(1,	'gallery',	'berkas/home/gallery/1652095225.jpg',	'',	NULL,	0,	NULL,	0,	NULL,	NULL,	NULL,	NULL,	1652095164,	1652095225,	1),
(2,	'benefit',	'berkas/home/benefit/1652108838.jpg',	'Mentoring',	'Dimentori dengan mentor yang berpengalaman',	0,	NULL,	0,	NULL,	NULL,	NULL,	NULL,	1652095621,	1652108909,	0),
(3,	'gallery',	'berkas/home/gallery/1652095685.jpg',	'',	NULL,	0,	NULL,	0,	NULL,	NULL,	NULL,	NULL,	1652095685,	0,	1),
