(3,	'Education Consultant',	'berkas/other-program/content/1651854176.jpg',	'<p>Saat ini YBB sangat aktif dalam memberikan informasi untuk para pelajar Indonesia yang ingin melanjutkan pendidikan ke Luar Negeri. Saat ini sosial media YBB sangat aktif dalam membagikan berbagai macam informasi beasiswa, mentoring serta ikut serta dalam mendampingi pelajar Indonesia belajar ke luar negeri.</p>\r\n\r\n<p>ig:@ybbedu.id</p>\r\n\r\n<p>web:</p>\r\n',	0,	1651854176,	0,	0),
(4,	'YBB School ',	'berkas/other-program/content/1652356440.jpg',	'<p>YBB School saat ini banyak berkontribusi dengan banyak sekolah, lembaga, dan organisasi untuk meningkatkan pendidikan pelajar khususnya dalam bidang bahasa. Selain itu, YBB juga aktif untuk mengadakan seminar baik secara online maupun offline ke berbagai lembaga dan sekolah.</p>\r\n\r\n<p>@ybbturkishschool @ybbenglishschool @ybbarabicschool</p>\r\n',	0,	1651854193,	1652356440,	0),
(5,	'YBB Store',	'berkas/other-program/content/1651854212.jpg',	'<p>YBB Store menjadi salah satu platform jual beli merchandise sampai buku tulisan karya anak bangsa yang kuliah di&nbsp; luar negeri.&nbsp;</p>\r\n\r\n<p>ig: @ybbstore</p>\r\n',	0,	1651854212,	0,	0);
INSERT INTO `tb_scholarship` (`scholar_id`, `user_id`, `full_name`, `date_birth`, `whatsapp_number`, `current_address`, `field_study`, `school`, `current_gpa`, `semester`, `about`, `dream_come`, `volunteer`, `status`, `created_at`, `modified_at`, `is_deleted`) VALUES
('SCHLR-BDLLH-cbfea1',	'USR-BDLLH-cc95e',	'Abdullah Faiq Ramadhan',	'2004-10-22',	'81366495786',	'Perum cipondoh indah jl.seruni no 154 cipondoh kota tangerang',	'Pendidikan keagaman',	'MAS HUSNUL KHOTIMAH',	'0',	'0',	'Halo saya adalah seorang siswa dengan latar pendidikan di pondok pesantren dengan mengambil jurusan agama tetapi saya memilih untuk berpindah ke jurusan sosial saat ini demi mencapai mimpi saya sebagai seorang pengusaha muda yang memiliki jiwa sosial. Saya adalah siswa yang cukup aktif di berbagai organisasi seperti osis yang melatih jiwa kepemimpinan saya serta komunitas bisnis yang mengasah skill skill saya saya saya juga orang yang cukup aktif di media sosial aktif untuk mencari kegiatan kegiatan seperti volunteer,lomba dan hal2 yang bermanfaat lainnya',	'Anak jalanan,anak kecil yang ditelantarkan orang tuanya,orang2 susah diluaran sana mereka semua adalah alasan saya ingin menjadi wadah bagi mereka semua agar mereka hidup dengan layaknya bisa melihat dunia yang indah. menjadi pengusaha sukses dan bermanfaat bagi orang lain adalah mimpi terbesar saya dan saya ingin membuatkan wadah bagi mereka semua dengan cara apa? kesuksesan.bagaimana cara mewujudkannya? Semua dimulai dari hal2 kecil. Membantu sesama orang yang membutuhkan, belajar dengan giat tentang dunia bisnis dan mulai mempraktekannya ,mengikuti organisasi2 sosial atau kegiatan sosial yang itu semua membuat perlahan2 mimpi2ku bisa terwujud',	'Saya punya pengalaman menjadi anggota osis di sekolah dengan jabatan sebagai penerima tamu internal mau pun eksternal dimana disitu saya diajarkan adab dan bersosial dengan orang2 baru serta melatih soft skill saya dalam berbicara maupun jiwa kepemimpinan  juga saya memiliki pengalaman di organisasi disekolah bernama kabilah dagang yang dimana disana tempat berkumpulnya para pebisnis kecil2an. dan disana menjadi ajang tempat pembelajaran bagi saya bagaimana cara mengelola bisnis yang baik saya juga memiliki pengalaman sosial dimana saya saat itu ada kegiatan dari sekolah saya untuk belajar dari masyarakat di desa terpencil selama 3 minggu.tidur dengan warga setempat,makan bersama disana memberikan edukasi kepada mereka mengajak anak2 membaca berhitung menulis mengaji,melakukan kegiatan seru2an lomba2 dan masi banyak hal lainnya canda,tawa,sedih dilalui saat kegiatan.itu merupakan pengalaman yang tak pernah saya lupakan sepanjang hidup saya',	1,	1654531124,	NULL,	0),
('SCHLR-BDLRH-e16c7e',	'USR-BDLRH-81907',	'ABDUL ROHMAN',	'2005-03-31',	'85760072913',	'Padangsidimpuan',	'Tehnik komputer dan jaringan',	'SMKN 1 BATANG ANGKOLA',	'8.00',	'1',	'Saya merupakan anak ke 5 dari 5 bersaudara saya terlahir dari keluarga yang tidak mampu. Saya merupakan siswa kls 11 di SMK 1 BATANG ANGKOLA Alhamdulillah saya selalu mendapat rangking di kelas dan saya berharap dengan mengikuti program beasiswa ini dapat membantu perekonomian keluarga saya',	'Menjadi seorang IT yang handal dan untuk mencapainya saya  sering mengikuti pelatihan dari berbagai universitas dan organisasi supaya ilmu saya semakin terasah',	'Saya ikut organisasi di daerah saya yaitu NNB suatu organisasi pemuda pemudi desa yang bertujuan membantu masyarakat',	1,	1655615024,	NULL,	0),
('SCHLR-BDLZZ-34f538',	'USR-BDLZZ-217da',	'Abdul Aziz Saputra',	'2001-10-19',	'82366670446',	'jl. fatahillah III No. 8, Geuceu Iniem, Banda Raya, Banda Aceh, Aceh',	'Ilmu Administrasi Publik/ FISI',	'Universitas Iskandar Muda',	'3.63',	'3',	'aku seorang mahasiswa semester 4, yang sedanh mencari beasiswa untuk membantu kebutuhan hidup dan spp kuliah',	'mimpi terbesarku menjadi pengusaha sukses, dan sekarang aku sudah memulai usaha ternak ayam kecil kecilan',	'aku punya pengalaman organisasi dipondok pesantren dulu semasa aku masi sma, dan pernah jadi relawan covid-19 pada tahun 2020',	1,	1653830033,	NULL,	0),
('SCHLR-BDRHM-9b7274',	'USR-BDRHM-b6cb8',	'Abd rahman',	'1993-07-17',	'82346578936',	'Baranti ',	'Fakultas keperawatan',	'Itkes Muhammadiyah sidrap',	'0.00',	'2',	'Tdk ada yg menarik pada diri saya ,sejak SD orang tua bercerai saya tinggal bersama nenek dan sekarang sudah berkeluarga di karuniai seorang anak dan bekerja d sebuah instansi puskesmas ',	'Mimpi terbesar menjadikan setiap aktifitas bernilai ibadah ,menjadi kepala puskesmas jika diberikan amanah tpi tdk akan menuntut dan mengurus dijadikan kepala ',	'Organisa kampus seputar penggalangan dana kampus ,relawan donor darah ,organisasi dakwah ',	1,	1653891202,	NULL,	0),
('SCHLR-BDTSH-e87786',	'USR-BDTSH-4fa23',	'Abidatusholihat',	'2000-10-29',	'82179457280',	'No 1, RT 1, RW 1, Sawojajar 1, Kotabumi Utara, Lampung Utara, Lampung',	'Agribisnis/Penyuluhan Pertania',	'Universitas Lampung',	'3.65',	'6',	'Saya adalah pemudi Indonesia yang bernama Abidatusholihat, saya lahir di Desa Sawojajar, Kecamatan Kotabumi Utara, Kabupaten Lampung Utara, pada tanggal 29 Oktober 2000. Dan menjadi anak ketiga dari enam bersaudara oleh orang tua bersuku Jawa yang tinggal di Lampung. \r\n\r\nSaya memiliki hobi di bidang multimedia yaitu desain grafis, animasi, videografi dan yang berhubungan dengan komponen computer atau laptop. Sebagian besar penyaluran hobi ini dilakukan dengan menonton tutorial maupun informasi terkini serta beberapa kegiatan yang bisa disalurkan melalui kegiatan di organisasi kampus maupun postingan pribadi.\r\n\r\nSaya salah satu mahasiswa Program Studi Penyuluhan Pertanian, Jurusan Agribisnis, Fakultas Pertanian. Program studi saya sebenarnya berbeda dari ketertarikan saya, karena saya lebih tertarik pada bidang teknologi dan desain. Akan tetapi, rasa ketertarikan terhadap pertanian mulai meningkat seiring bertambahnya insight baru baik dari mata kuliah yang dipelajari maupun teman-teman Fakultas Pertanian yang sering kali membicarakan isu-isu pertanian. Dan benar, pada semester awal sudah ditumbuhkan rasa tanggung jawab bahwa mahasiswa Penyuluh Pertanian akan menjadi ujung tombak pertanian Indonesia. Dan ternyata terdapat korelasi antara ketertarikan saya yaitu di bidang teknologi dan desain dengan dunia pertanian yang bisa membantu kemajuan pertanian. Hal itu memberikan target baru saya yang ingin saya wujudkan, yaitu berkontribusi untuk mewujudkan kesejahteraan kehidupan para petani dengan potensi yang saya punya.',	'Saya ingin menjadi salah satu penggerak dalam upaya pemberdayaan masyarakat dan memotivasi orang lain untuk ikut serta yang diwadahi dengan sebuah komunitas. Penyuluh pertanian memiliki peran penting dalam peningkatan kesejahteraan petani. Di program studi inilah saya membekali diri bagaimana cara menyampaikan pemahaman mengenai informasi dan inovasi seputar pertanian agar usahatani para petani bisa berjalan secara efektif dan efisien serta meningkatkan produk maupun produktivitasnya. Dengan fokus pada pemberdayaan masyarakat yaitu menciptakan masyarakat yang mandiri maka perlu dilakukan edukasi dengan langkah cermat agar masyarakat tahu, mau, dan mampu menerapkan kemajuan-kemajuan yang selalu berkembang. Pada salah satu program pembelajaran yang saya ikuti yaitu sekolah desa yang diadakan oleh Payungi University, Metro, menjelaskan beberapa upaya pemberdayaan masyarakat yang sebagian besar kontribusi kerjanya dilakukan oleh,dari dan untuk masyarakat desa, dengan gebrakan tim “Penggerak” disana yang mampu mengajak satu desa tersebut untuk kompak menuju satu tujuan bersama. Dan tentu saja penerapannya tidak semudah yang terdengar, karena masyarakat yang perlu digerakkan memiliki jumlah yang tidak sedikit. Namun, dari pengalaman itulah yang membakar semangat saya untuk mengikuti jejak “Penggerak” yang mampu menggerakkan masyarakat dan berkontribusi lebih dalam pembangunan Indonesia.\r\n\r\nUntuk mencapai kapasitas yang mumpuni, saya tidak hanya belajar di perkuliahan namun juga mengikuti berbagai organisasi yang bisa mengasah kemampuan bersosialisasi, kerja tim, manajerisasi, kepemimpinan, public speaking dan tentu saja teman diskusi yang bisa mampu meningkatkan pola berpikir saya. Dengan kemampuan di bagian multimedia, saya bertugas untuk mem-branding organisasi saya dan hal itu masih saya geluti sehingga beberapa kali mengikuti komunitas usutan mahasiswa yang bertujuan untuk menumbuhkan kebiasaan-kebiasaan baru.\r\n\r\nBila sudah mencapai kapasitas sebagai lulusan Sarjana Penyuluhan Pertanian, saya ingin membuat tim “Penggerak” yang bisa membantu para petani untuk menjual hasil taninya secara maksimal, baik dalam pendistribusian, pengolahan, maupun pemasarannya. Terinspirasi dengan salah dua alumni pada organisasi yang saya ikuti, diantaranya mampu menjadi duta petani millenia dan pengusaha bisnis keripik, dalam pelaksanaannya keduanya menerapkan nilai-nilai Islam seperti berinfaq, sholat dhuha dan lainnya, dan hal itu bukan diterapkan untuk pribadi sendiri tetapi kepada rekan kerja dan masyarakat sekitar. Dengan mengadaptasi dan menginovasikannya, saya ingin menciptakan suatu kelompok tani yang bisa menerapkan budaya sedekah sesedikitpun itu sehingga lambat laun akan terbiasa untuk melakukan kebaikan kedepannya.',	'Ada beberapa organisasi yang memiliki kontribusi besar dalam proses pembentukan diri saya di kuliah, yaitu Lembaga Dakwah Fakultas : Forum Studi Islam Fakultas Pertanian (FOSI FP) dan Lembaga Dakwah Kampus : Bina Rohani Islam Mahasiswa (Birohmah). Ketika aktif di FOSI FP saya diamanahkan sebagai Sekretaris Bidang Media Center pada tahun 2020 dan sebagai Wakil Ketua Umum pada tahun 2021, sedangan di Birohmah, saat ini saya sedang diamanahkan sebagai Sekretaris Dapartemen Media dan Branding. Dalam wadah organisasi inilah saya dapat berkembang baik dari kemampuan bersosialisasi, kerja tim, manajerisasi, kepemimpinan, public speaking dan tentu saja teman diskusi yang bisa mampu meningkatkan pola berpikir. Selain itu hobi saya bisa tersalurkan tentunya di bagian multimedia, yang bertugas untuk mem-branding sebuah organisasi organisasi. Selain organisasi, saya ikut beberapa komunitas sebagai pengalaman belajar dalam memanajemen waktu ditengah beberapa kesibukan. Dengan program-program yang dicanangkan fokus pada gerakan kebaikan kepada civitas akademik maupun masyarakat yang mampu mengingatkan saya pada tujuan awal saya yaitu menjadi penyuluh pertanian yang mampu memberikan banyak kebermanfaatan. Ada banyak sekali yang dialami petani dalam melakukan usaha tani. ',	1,	1655392404,	NULL,	0),
('SCHLR-BGSJN-6a6fe4',	'USR-BGSJN-236c1',	'Bagas Juniver',	'2003-06-12',	'82287612690',	'Air Amo, Sumatera Barat',	'Fisika',	'Universitas Negeri Padang',	'3.65',	'2',	'Saya merupakan mahasiswa aktif Universitas Negeri Padang. Sejak kecil saya suka bermain ke hutan mengeksplorasi hutan dan mencari buah-buahan. Ketika SMA, saya pernah mendapatkan prestasi berupa juara 2 Kompetisi Sains Nasional tingkat kabupaten di bidang fisika dan melanjutkan kompetisi tersebut ke tingkat provinsi. Saya suka bekerja keras dan menyelesaikan tugas sebelum batas waktu yang diberikan. Ketika SMA, peringkat saya pernah turun dari 5 besar menjadi peringkat 18 saat ujian tengah semester. Hal ini membuat saya kaget karena saya belum pernah mendapatkan peringkat tersebut. Hal ini membuat saya harus bekerja keras untuk memulihkan keadaan. Dalam satu bulan lebih ketika ujian akhir semester saya berhasil menaikkan peringkat saya menjadi peringkat 6 ketika penerimaan raport semester. Ketika kuliah, saya aktif dalam berkolaborasi dan berkontribusi dalam pengerjaan tugas kelompok. Bahkan sesekali saya yang memimpin tugas tersebut. ',	'Ada banyak mimpi yang ingin saya wujudkan. Diantara mimpi tersebut adalah melanjutkan S2 ke luar negeri. Saya ingin merasakan bagaimana sistem pendidikan yang ada di negara maju. Untuk menggapai hal tersebut bukanlah hal yang mudah. Oleh sebab itu, saya sudah merancang persiapan dari semester 2 ini. Saya harus serius dalam menjalani perkuliahan agar nilai saya tinggi. Tapi terkadang ada beberapa hal yang menggambar seperti pendanaan. Oleh sebab itu, saya mendaftar beasiswa ini gara kuliah S1 saya lancar. Saya juga mendaftar banyak program pengabdian untuk melatih softskill saya dan menambah relasi. Selain itu, saya juga akan mulai mendalami bahasa asing yang mana sangat penting untuk zaman sekarang ini. Selain itu, saya juga aktif mencari informasi tentang studi abroad di sosial media dan peluang beasiswa terkait.',	'Ketika SMA, saya pernah mengikuti organisasi remaja masjid. Organisasi ini bertugas untuk menjadi relawan dalam masjid. Hampir setiap pagi kami membagikan sarapan subuh bagi jamaah pengajian. Kami juga aktif bergotong royong membersihkan masjid agar semakin nyaman untuk beribadah. Bahkan kami sukses menggelar tabligh Akbar dengan menghadirkan dai nasional sebagai pembicara.\r\nKetika kuliah ini, saya juga sudah menyiapkan beberapa list organisasi yang akan saya ikuti diantaranya ada menwa, pusat pengembangan ilmiah dan penelitian mahasiswa, serta organisasi kerohanian. Ini merupakan kesempatan bagi saya untuk meningkatkan kualitas diri saya.',	1,	1655695109,	NULL,	0),
('SCHLR-BGSKH-6671c8',	'USR-BGSKH-94cdc',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655135510,	NULL,	0),
('SCHLR-BGSKH-be1db5',	'USR-BGSKH-94cdc',	'Bagas Ikhwan Muharram',	'2000-04-18',	'85770191380',	'Perum. Gardenia Sepatan Blok F No. 28 RT 02/RW 11, Kec. Sepatan, Kel. Pisangan Jaya, Kab. Tangerang, Banten. 15520 ',	'Prodi Pendidikan Tata Niaga',	'Universitas Negeri Surabaya',	'3.57',	'3',	'Perkenalkan nama saya Bagas Ikhwan Muharram, biasa dipanggil Bagas.  Saat ini saya berusia 22 tahun, berdomisilli di Kab. Tangerang, Banten. Saya seorang mahasiswa Prodi Pendidikan Tata Niaga, Fakultas Ekonomika dan Bisnis, Universitas Negeri Surabaya. Dan saat ini saya menempuh pendidikan di bangku perkuliahan sudah mencapai semester 4 dengan IPK 3.57/4.00 pada angkatan 2020.  Saya juga memiliki latar belakang jurusan Multimedia, yang saya peroleh saat pendidikan SMK. Saya memiliki beberapa hobi diantarannya yaitu fotografi , editing foto dan vidio, design poster , serta olahraga badminton. Saya Pribadi orang yang menyukai hal-hal baru dan juga komitmen pada pekerjaan maupun aktivitas yang sedang saya lakukan. Saya memprioritaskan sikap, jujur,tanggung jawab, disiplin dan dapat di andalkan di tiap segala aktivitas serta dilandasi dengan penuh rasa semangat. Dan saya pribadi memiliki skill basic dalam mengoperasikan Ms. Office, aplikasi editing adobe premier dan adobe photoshop. \r\nSemasa sekolah SMK saya meraih prestasi akademik yaitu : \r\ndan disini saya juga memperoleh prestasi akademik semasa SMK yaitu : \r\n-	kelas 10 semester 1 peringkat 1 \r\n-	kelas 10 semester 2 peringkat 1 \r\n-	kelas 11 semester 3 peringkat 3 \r\n-	kelas 11 semester 4 peringkat 11 \r\n-	kelas 12 semester 5 peringkat 1 \r\n-	kelas 12 semester 6 peringkat 1\r\n\r\nDan prestasi non Akademik yaitu : \r\n-	Juara 1 Lomba cerdas cermat \r\nDan disaat sebelum memasuki bangku perkuliahan saya pernah mengikuti internship dan memiliki pengalaman kerjaan diantarannya yaitu : \r\n1.	PT Takagi Sari Multi utama (internship)\r\nDitempatkan di divisi Quality Control Prakerin dilakukan selama 3 bulan (Februari 2017 – Mei 2017)\r\n2.	PT Paragon Technology and Innovation \r\nDitempatkan di divisi Quality Control Validasi, masa kontrak dilaksanakan selama 6 bulan (Juli 2019 – Januari 2020)\r\nDan disaat kuliah ini saya aktif mengikuti Organisasi Mahasiswa Daera (ORMADA) Jabodetabek, namun dikarenakan pada tahun 2020-2021 kegiatan pembelajaran dikampus secara online, maka organisasi tersebut hanya melakukan kegiatan dan perkumpulan secara online melalui media sosial hingga saat ini. Saya juga tergabung Unit Kegiatan Mahasiswa (UKM) yaitu badminton dan Aktivitas Fotografi di kampus Universitas Negeri Surabaya (UNESA). Di kegiatan UKM badminton yaitu melakukan pelatihan badminton rutinitas serta mengadakan perlombaan badminton yang diselenggarakan secara regional maupun nasional sedangkan di UKM Fotografi mengikuti pelatihan dasar fotografi, pelatihan tata cara mengambil foto yang bagus, dan adannya perlombaan fotografi. Dan saya juga aktif mengikuti berbagai kepanitiaaan organisasi.  Selama mengikuti Organisasi kemahasiswaan, UKM, dan kepanitiaan saya terus mengasah potensi yang ada di diri saya baik secara soft skill maupun hard skill, sehingga saya dapat memperoleh wawasan, pengalaman, komunikasi, kerja sama, adaptasi dengan lingkungan, manajemen, dan pengedalian diri. Dan selama saya kuliah saya juga aktif mengikuti berbagai macam perlombaan dan memperoleh prestasi. Diantarannya yaitu: \r\n1.	Memperoleh Prestasi fotografi - Tingkat Fakultas sebagai Juara II\r\nJudul kegiatan Ekspresikan Diri Wujudkan Mimpi Melalui Karya Dan Prestasi dilaksanakan pada 20 Nopember 2020 oleh Badan Eksekutif Mahasiswa Fakultas Ekonomi Universitas Negeri Surabaya. \r\n2.	Memperoleh prestasi dalam kegiatan  Pemikiran Kritis - Tingkat Nasional sebagai Finalis\r\nJudul kegiatan Lomba Opini Sungai 2020 dilaksanakan pada 03 Nopember 2020 oleh Himpunan Mahasiswa Agrometeorologi (HIMAGRETO), IPB University. \r\n3.	Memperoleh Prestasi Fotografi -  Tingkat Nasional sebagai Juara Harapan\r\nJudul kegiatan UNKARUPA UNESA ART COMPETITION ENLIGHTEN 4 dilaksanakan pada 02 Januari 2021 oleh pameran UNKARUPA 4 .\r\n4.	Memperoleh Prestasi Vidiografi - Tingkat Jurusan/Program Studi sebagai Juara I\r\nJudul kegiatan \"Memaknai Keistimewaan Bulan Ramadhan guna Memperkokoh Iman, Kepedulian dan Ketaqwaan dalam Diri\" dilaksanakan pada 24 April 2021 oleh Himpunan Mahasiswa Jurusan Pendidikan Ekonomi, Fakultas Ekonomi Universitas Negeri Surabaya\r\n5.	Memperoleh Prestasi fotografi  - Tingkat Jurusan/Program Studi sebagai Juara II\r\nJudul kegiatan \"Memaknai Keistimewaan Bulan Ramadhan guna Memperkokoh Iman, Kepedulian dan Ketaqwaan dalam Diri\" dilaksanakan pada 24 April 2021 oleh Himpunan Mahasiswa Jurusan Pendidikan Ekonomi, Fakultas Ekonomi Universitas Negeri Surabaya\r\n6.	Memporeh prestasi lomba debat NUDC – tingkat Jurusan/program studi sebagai juara I \r\nSaya juga orang yang berambisi dan aktif dalam mengikuti berbagai aktivitas yang positif karena tentunnya saya memperoleh banyak benefit, pengetahuan baru, meningkatkatkan skill, memperluas koneksi, dapat terus mengimprorivasi diri, dan mengevaluasi diri untuk menjadi pribadi yang lebih baik lagi.\r\n',	'Pada dasarnnya semua orang  bebas menciptakan impian setinggi apapun. Dan Impian besar saya yaitu saya penuh harap bisa mengisi posisi impian saya untuk bekerja di perusahaan startup dengan dibekali wawasan dan skill yang saya pelajari. Karena yang kita ketahui bahwa perusahaan startup digital saat ini sangat berkembang di  Indonesia maupun di lingkup internasional. Perusahaan startup cenderung menggunakan sistem online untuk memasarkan ataupun mengenalkan produk. Hal ini sesuai dengan apa yang saya pelajari dibangku perkuliahan dan sesuai dengan minat serta passion saya, maka dari itu saya sangat tertarik untuk dapat bekerja di perusahaan startup Indonesia. Untuk mewujudkan dari impian saya tersebut yaitu bisa mempelajari materi-materi ilmu digital marketing, entrepreneur, pemasaran bisnis, dan manajemen sumber daya manusia. Dan dapat mengikuti banyak pelatihan untuk memperluas wawasan, menambah pengalaman, dan dapat meningkatkan soft skill. Tentu saya harus Fokus pada kegiatan pelatihan  yang sedang dikerjakan, bersikap untuk berpikir positif, tidak berhenti untuk belajar di ilmu tertentu tetapi juga selalu ingin mempelajari hal-hal baru, percaya dengan kemampuan diri sendiri, dan pastinnya bersungguh sungguh, memiliki tekad yang kuad, dan selalu berdoa kepada tuhan agar impian bisa terwujud. Jadi saya fokus apa yang sedang saya lakukan saat ini, karena kegiatan apapun yang saya lakukan saat ini juga berdampak pada masa depan  yang akan datang.  Namun, jika impian saya belum terwujud saya percaya bahwa tuhan memiliki skenario lain dan memiki rencana yang baik untuk masa depan saya. Yang terpenting dalam hidup untuk meraih impian setidak nya mau berusaha dan mencoba because if you never try, you will never know. ',	'Tentu ada yaitu, \r\n1. Panitia sebagai sie dokumentasi dalam Suatu Kegiatan Kemahasiswaan\r\nTingkat Nasional Judul kegiatan \"How To Be Young Investor\" dilaksanakan pada 27 Maret 2021 oleh Capital Market Community Universitas Negeri Surabaya. \r\n\r\n2. Panitia dalam Suatu Kegiatan Kemahasiswaan\r\nTingkat Internasional Judul kegiatan In the \"Malaysia Indonesia Investment Essay Competition by theme \"Investment Innovation to Build the Country\" dilaksanakan pada 08 April 2021 oleh Oganized by Capital Market Community Faculty of Economics and Business. \r\n3. Mengikuti Pelatihan Kepemimpinan LKMM\r\nTingkat Dasar Judul kegiatan Mengembangkan Mahasiswa Menjadi Seorang Organisator Yang T.U.N.T.A.S (Tanggap, Ulet, Nasionalis, Terampil, Aktif, Solid) dilaksanakan pada 22 April 2021 oleh HMP Pendidikan Ilmu Pengetahuan Sosial, Fakultas Ilmu Sosial dan Hukum, Universitas Negeri Surabaya\r\n4. Mengikuti kegiatan volunteer Gerakan Literasi Keluarga yang di selenggarakan secara daring oleh Literatus Cendikiaone dan literasi berdaya yang dimulai pada tanggal 29 Juni 2021\r\n5.  UKM Badminton ( September 2020 - sampai saat ini) \r\n6.  Ormada Jabodetabek (Kegiatan akan aktif ketika kampus sudah menerapkan pembelajaran secara luring)\r\n7. UKM Fotografi (Januari 2021- sampai saat ini) ',	1,	1655714904,	NULL,	0),
('SCHLR-BHMPY-b306fa',	'USR-BHMPY-0b268',	'Bhiempy Karishma Nurhakim ',	'2004-03-18',	'81316078816',	'Perum Gunung Intan B 19',	'Tata Kecantikan ',	'SMKN 2 Kota Cirebon (lulus)',	'8.78',	'0',	'Saya merupakan lulusan SMKN 2 Kota Cirebon, jurusan Tata Kecantikan. Membaca dan menulis sudah menjadi hobi saya sejak lama. Ada beberapa karya cerpen yang sudah saya hasilkan. Saya tipikal orang yang santai. Saya dapat bekerja/beraktivitas dibawah tekanan, walaupun saya berharap tidak terjadi. Karena saya akan tenang menghadapi masalah. Kelemahan saya hanya sering lupa akan sesuatu dan sering nya melamun. Namun, sebisa mungkin saya meminimalisir nya dengan mencatat atau mengerjakannya saat itu juga. Untuk melamun, saya suka menjadikannya sebagai cara untuk mencari ide.',	'Menjadi seorang penulis. Cara saya mewujudkannya adalah konsisten menulis setiap hari dan menerima kritik dan saran untuk memperbaiki tulisan saya, serta terus mencari tahu ilmu seputar sastra',	'Iya, saya pernah terjun langsung untuk membagikan makanan untuk anak yatim piatu. Saya pernah menjabat sebagai sekretaris di suatu organisasi yang mana tugas saya saat itu adalah mendata anggota yang ada, membuat notulen rapat, membuat surat-menyurat, mengoperasikan microsoft word, dan berkonsultasi kepada ketua departemen saat membuat laporan triwulan. Saya juga pernah menjadi leader suatu komunitas yang mana saya dituntut untuk tegas saat mengambil keputusan, pola pikir saya diuji saat itu karena harus menghadapi banyak pola pikir, dan juga cara untuk mengendalikan emosi saat bertemu dengan orang lain. Walaupun komunitas itu dilakukan online.',	1,	1655021452,	NULL,	0),
('SCHLR-BHMPY-f983e4',	'USR-BHMPY-0b268',	'Bhiempy Karishma Nurhakim ',	'2004-03-18',	'81316078816',	'Perum Gunung Intan B 19',	'Tata Kecantikan ',	'SMKN 2 Kota Cirebon (lulus)',	'8.78',	'0',	'Saya merupakan lulusan SMKN 2 Kota Cirebon, jurusan Tata Kecantikan. Membaca dan menulis sudah menjadi hobi saya sejak lama. Ada beberapa karya cerpen yang sudah saya hasilkan. Saya tipikal orang yang santai. Saya dapat bekerja/beraktivitas dibawah tekanan, walaupun saya berharap tidak terjadi. Karena saya akan tenang menghadapi masalah. Kelemahan saya hanya sering lupa akan sesuatu dan sering nya melamun. Namun, sebisa mungkin saya meminimalisir nya dengan mencatat atau mengerjakannya saat itu juga. Untuk melamun, saya suka menjadikannya sebagai cara untuk mencari ide.',	'Menjadi seorang penulis. Cara saya mewujudkannya adalah konsisten menulis setiap hari dan menerima kritik dan saran untuk memperbaiki tulisan saya, serta terus mencari tahu ilmu seputar sastra',	'Iya, saya pernah terjun langsung untuk membagikan makanan untuk anak yatim piatu. Saya pernah menjabat sebagai sekretaris di suatu organisasi yang mana tugas saya saat itu adalah mendata anggota yang ada, membuat notulen rapat, membuat surat-menyurat, mengoperasikan microsoft word, dan berkonsultasi kepada ketua departemen saat membuat laporan triwulan. Saya juga pernah menjadi leader suatu komunitas yang mana saya dituntut untuk tegas saat mengambil keputusan, pola pikir saya diuji saat itu karena harus menghadapi banyak pola pikir, dan juga cara untuk mengendalikan emosi saat bertemu dengan orang lain. Walaupun komunitas itu dilakukan online.',	1,	1655021450,	NULL,	0),
('SCHLR-BKNRH-1e6fc3',	'USR-BKNRH-4179d',	'Baik Nur Hikmah ',	'2006-09-09',	'83177486766',	'Jalan lintas Sumatera,Bathin li Babeko, Simpang Babeko, RT.08, KAB. BUNGO, BATHIN II BABEKO, JAMBI, ID, 37251',	'Ips ',	'SMAN 2 Bungo ',	'3.00',	'1',	'Saya orang nya selalu penasaran dengan banyak hal jadi ketika saya memikirkan hal itu saya akan mencari informasi tentang hal itu baik dari internet maupun buku. Maaf untuk IPK nya soalnya saya masih sekolah dan gak bisa di lewat kan ',	'Ingin menjadi pembisnis dimulai degan cara membuka usaha kecil kecilan dulu sekitar 2 tahunan degan mempromosikan di media sosial maupun offline setelah dua tahun dan mengumpulkan cukup modal tambahan saya akan mulai membuka cabang di kota kota di Indonesia kalo bisa dan harus bisa saya ingin dapatkan mengekspor produk jualan saya ke berbagai belahan dunia.',	'Saya sering mengikuti program organisasi di sekolah seperti OSIS,  permukaan. Jika peramuka dikarenakan saya sangat suka degan tantangannya ',	1,	1653978204,	NULL,	0),
('SCHLR-BMJSS-b9bdc3',	'USR-BMJSS-f9d60',	'Bimo Aji Suseno Bimo',	'2002-12-09',	'83856310562',	'Desa Blumbungan, Kec. Larangan. Kab. Pmekasan',	'Psikologi',	'Universitas Negeri Malang',	'3.37',	'4',	'Saya adalah mahasiswa prestasi di Universitas Negeri Malang. Saya aktif mengikuti lomba KTI dan PKM, Saya juga sering mengikuti lomba catur baik tingkat regional sampai internasional. Saya juga aktif di UMKM dan wirausahawan. namun saat ini Saya terkendala oleh biaya sekolah dan biaya kehidupan di Malang.',	'Pendidikan sampai S3 dan bermanfaat bagi masyarakat minimal di sekitar Saya. Tetap konsisten untuk belajar dan pengembangan diri serta tetap menempuh pendidikan setinggi-tinggi nya.',	'Iya. Saya aktif di Organisasi daerah (IMAPADA) dan ASC (Al-Quran Study Club), serta Saya juga kerja di BMH (Baitul Mal Hidayatullah) dan menjadi relawan Semeru perwakilan UM.',	1,	1655633244,	NULL,	0),
('SCHLR-BNFSS-d732a7',	'USR-BNFSS-b66c3',	'Bonifasius Tarigan',	'2003-10-08',	'81273394449',	'Desa Lambar',	'Informatika',	'Telkom University',	'4.00',	'2',	'Saya adalah mahasiswa dari desa di Sumatera Utara yang sedang merantau di Kota Bandung. Saya sedang menempuh semester 2 jurusan S1 Informatika di  Telkom University. Saya sedang mendalami bidang Android Mobile Programming. Saya sering membuat foto produk dan review youtube. Saya memiliki ketertarikan yang luas terhadap banyak hal, seperti fotografi, videografi, saham, dan olahraga. Disamping itu, saya juga ingin meningkatkan softskill saya, seperti public speaking, kerja sama tim, dll. Oleh karena itu, saya senang mempelajari hal-hal baru.',	'Saya ingin menjadi seorang Backend Developer. Untuk mencapai tujuan tersebut, saya memulai langkah dengan bergabung ke organisasi yang berkaitan dengan pengembangan software yang tentunya selain memberikan pengalaman dan pengetahuan pengembangan software juga akan melatih softskill serta relasi saya dengan teman-teman seminat. Selain itu, saya juga mengikuti beberapa kursus-kursus online berkaitan dengan pengembangan software juga yang dapat meningkatkan skill dan memberikan sertifikasi keahlian bagi saya. Kedepannya, saya berencana untuk mulai memasuki dunia freelance project hingga pekerjaan sesungguhnya.',	'Saat ini saya bergabung ke dalam dua organisasi kampus, yaitu Mobile Innovation Lab (Motion lab) dan Persatuan Catur Mahasiswa (PCM). Di motionlab saya telah mendapatkan pengalaman menarik. Pertama, belajar bersama dengan teman-teman satu divisi dan minat dan saling mengutarakan pengetahuannya dengan yang lain. Secara tidak langsung, ini melatih kemampuan berkomunikasi dan diskusi bagi saya. Kedua, motionlab pernah mengadakan Hackathon dalam proses seleksinya, dimana saya sebagai programmer akan bekerja sama dalam satu tim dengan Bussiness Analyst dan UI/UX membuat dan memaparkan produk digital. Tentunya cukup menguras energi, terlebih lagi pada saat itu saya masih pemula yang baru mencoba membuat aplikasi. Sedangkan di PCM, saya melatih salah satu hobi saya, bermain catur. Setiap minggu diadakan latihan dan liga catur internal. Walau tidak selalu menjadi juara teratas, saya merasa menikmati rutinitas ini.',	1,	1655740892,	NULL,	0),
('SCHLR-BNGPJ-af0316',	'USR-BNGPJ-c7762',	'Bunga Puja Sabrina ',	'2003-05-29',	'89637408023',	'Jl. Durian Utara II No 29 B, RT 10 RW 01, Banyumanik, Semarang, Jawa Tengah ',	'Keperawatan ',	'Poltekkes Kemenkes Semarang ',	'3.61',	'2',	'Bunga Puja Sabrina adalah nama yang diberi bapak dan ibuku. Saya tinggal bersama kedua orang tua, 2 kakak dan 6 adik. Semenjak kecil orangtua selalu mengajarkan untuk mandiri. Semenjak SD tiap pulang saya berjalan kaki, sebagai seorang anak dan sekaligus kakak saya berharap bisa memberikan contoh yang baik kepada keluarga maupun masyarakat. Saya selalu percaya apapun yang terjadi dalam kehidupan ini sudah menjadi rencana Allah. ',	'Mimpi terbesar saya adalah melihat kedua orang tua bahagia. Banyak cara yang sudah saya lakukan untuk mendapatkan hal itu, akan tetapi belum berhasil. Rasa ingin menyerah pasti ada, akan tetapi saya percaya bahwa Tuhan tidak akan membiarkan hambanya untuk gagal terus. Mulai dari mengikuti lomba hingga mendaftar beasiswa semoga Allah mudahkan segala prosesnya. Dengan visi misi yang sama dan rencana mimpi masa depan yang tinggi, namun saya mempunyai banyak adik dan sebagai tanggung jawab sebagai anak sekaligus kakak saya mendaftar beasiswa ini. Dengan semangat agar berprestasi dan berkualitas dimanapun, kapanpun serta unggul sesuai dengan motto Youth Break the Boundaries. ',	'Semenjak SMA saya aktif dalam PMR dimana kegiatan nya berfokus pada kemanusiaan. Seperti donor darah, membantu korban bencana, mitigasi bencana dan kegiatan sosial lainnya. Selain itu juga saya aktif dalam dunia kepenulisan, sudah pernah membuat beberapa karya maupun menulis buku dan saya berharap bisa mewujudkan ide - ide tersebut dengan harapan dapat berkontribusi bagi banyak orang.\r\n ',	1,	1655593069,	NULL,	0),
('SCHLR-BNGRS-5fb9ba',	'USR-BNGRS-081b2',	'Bunga Restu Ningsih',	'2002-09-13',	'87855807395',	'Sendang Biru, rt 15, rw 03, Sumbermanjing Wetan, Malang, Jawa Timur',	'Hukum',	'Universitas Negeri Semarang',	'3.86',	'2',	'Nama saya Bunga Restu Ningsih, orang-orang disekitar saya memanggil saya Bunga. Saya adalah mahasiswa jurusan Ilmu Hukum di Universitas Negeri Semarang angkatan 2021. Membaca buku dan menulis puisi adalah hobi yang saya miliki. Saya mengikuti organisasi Teater SS yang ada di Universitas. ',	'Mimpi saya adalah membantu orang lain yang membutuhkan dan membuat orang disekitar saya bangga terhadap pencapain saya. Saya ingin sekali menegakkan keadilan agar tidak ada lagi kekhawatiran akan tindak kejahatan di masyarakat terutama bagi kalangan perempuan. Cara yang bisa saya lakukan adalah belajar dengan giat agar tujuan tersebut tercapai, dan jangan lupa menjadi pribadi yang lebih baik agar dapat membawa dampak positif untuk masyarakat dan kedepannya.',	'Iya, saat terjadinya musibah gunung  semeru 2021 silam, saya menjadi panitia yang bertugas mengumpulkan bantuan dari masyarakat sekitar untuk dijadikan satu lalu dikirimkan kekorban bencana. Sebagai panitia saya mendatangi kerabat terdekat dan meminta bantuan berupa pakaian yang dapat digunakan oleh korban, lalu mengumpulkan pakaian tersebut di rumah pak RT.',	1,	1655649964,	NULL,	0),
('SCHLR-BNTNG-245c91',	'USR-BNTNG-09536',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654222776,	NULL,	0),
('SCHLR-BNTNG-c83e4a',	'USR-BNTNG-09536',	'Bintang Agung Bestari',	'2002-08-30',	'81384564563',	'Gg Belimbing No 1065 Sorosutan, Umbulharjo, Kota Yogyakarta, Dareah Istimewa Yogyakarta',	'Teknik Elektro Fakultas Teknol',	'Universitas Nahdlatul Ulama Yo',	'3.82',	'2',	'Perkenalkan namaku Bintang Agung Bestari dikenal dengan sapaan Bintang. Aku adalah mahasiswa semester 2 Teknik Elektro di Universitas Nahdlatul Ulama Yogyakarta. Sejak kecil aku tinggal bersama keluarga, di dalam keluarga kami jumlahnya ada tujuh termasuk orang tua yang lengkap dan aku. Sejak kecil aku sudah merasakan bagaimana Indahnya hidup dalam keadaan ekonomi yang kekurangan, kami sekelurga adalah keluarga yang bisa dikatakan selalu berpindah-pindah tempat tingal. Bagaimana tidak saat SD saja aku pindah-pindah sekolah sebanyak 3 kali, hal yang menjadi alasan aku dan keluarga pindah ke sana - ke sini  karena Bapak ingin mencari pekerjaan yang layak untuk keluarganya. Bagiku bapak adalah seorng tokoh yang sanggat tangguh, beliau rela bekerja apapun demi menyanggupi anak-anaknya untuk melanjuti pendidikannya. sejak SD aku sudah belajar untuk membantu orang tua bekerja, aku membantu bapak berkebun, memanen sawit, memotong karet mencari ikan, mencari kayu bakar dan pada hari libur aku bergantiaan dengan ibu untuk berjualan hasil sayur dan tanaman kami di permukiman PT. Semua pekerjaan ini aku lakukan dengan sepenuh hati karena ini adalah upaya agar kami semua bisa melangsungkan hidup, kisah ini saat aku duduk di bangku SD tepatnya di sebuah Hutan Provinsi Jambi. Setelah lulus SD, bapak mempunyai rencana untuk membawa kami sekeluarga menuju Jakarta, dengan harapan hidup kami sekeluarga membaik. Setibanya kami di Jakarta, kami tidak tahu harus berbuat apa. Sampai suatu saat bapak memutuskan kita sekeluarga untuk berjualan pakaian,minuman, kopi dan dagangan asongan di sekitar Monas hingga Pasar Tanah Abang. Selama 2 minggu aku membantu keluarga berdagang. Sampai suatu saat bapak mengumpulkan kami di bawah jembatan dekat monas untuk membicarakan sesuatu yang sanggat menentukan dalam hidupku. Bapak-ku memohon kepada anak-anaknya untuk melanjutkan pendidikannya maka dengan ini bapak berniat untuk memasukan anak-anaknya ke Panti Asuhan di Jakarta. Kakak, aku, dan adik-adikku sanggat sedih mendengar ini semua, kami tidak rela berpiusah dengan orang tua kami, tapi bapak dan mamak memohon agar anak-anaknya mau melanjutkan pendidikannya, orang tua ku ingin melihat anak-anaknya menjadi orang yang sukses di masa depan nanti dan tentunya harus bisa membantu keluarga lain yang sedang kesusahaan saat nanti. Untuk melanjutkan mimpi bapak dan mamak akhirnya aku dan saudara kandungku di pindahkan ke Panti Asuhan. Perpisahaan ini adalah suatu moment yang tak bisa aku lupakan. Aku berjanji di dalam jiwa dan ragaku untuk mewujudkan mimpi orang tuaku, sejak berpisah dengan orang tuaku untuk melanjutkan tingkat pendidikan SMP, aku mulai sadar bahwa ada titipan dari orang tuaku yaitu untuk menjadi anak yang sukses dan bermanfaat bagi orang lain. Sejak saat itu aku mulai belajar dengan sungguh-sungguh, di Panti Asuhan aku banyak belajar sekali tentang kehidupan yang tidak selamanya kita akan bahagia dan tak akan selamanya kita juga akan sedih. Sejak masuk SMP aku selalu belajar dengan sungguh-sungguh sehingga aku selalu masuk peringkat 3 besar di SMP. Saat kelulusaan aku menceritakan semua ini kepada bapak dan mamak, mereka sanggat bahagia. Kemudiaan Bapak menitipkan kembali untuk melanjutkan mimpimu. Akhirnya aku memutuskan untuk masuk Sekolah Menengah Kejuruan Teknik Instalasi Tenaga Listrik, di sekolah aku sanggat haus akan ilmu teknologoi khususnya di bidang energi baru dan terbarukan. Di SMK aku juga selalu masuk peringkat 3 besar sampai lulus, dan akhirnya aku mencoba untuk mendaftar kuliah di Universitas Nahdlatul Ulama Yogyakarta dengan spesialis Teknik Elektro. Alhamdullilah semua ini berjalan dengan baik. di balik ini semua aku juga memilki segudang prestasi sejak SMP hingga saat ini diantaranya aku pernah mengikuti perlombaan olahrga seperti futsal, volley, takraw bahkan hingga kesenian seperti perkusi, pantomim musik dan lainya. Aku percaya bahwa hidup tidak selamanya sedih karena Tuhan selalu memberi hal yang indah bagi kita yang sabar dan ingat kepadanya.',	'Mimpi terbesarku adalah aku ingin menjadi Investor yang memilki aset 13 Trilyun dan memilki profesi sebagai Electrical Design Engineer. Cara ku mewujdukan ini semua adalah dengan belajar sunggu-sungguh. Sejak SMK aku memilih untuk menekuni dunia teknologi, aku termasuk siswa yang sanggat tertarik dengan Renewable Energy. Aku selalu belajar bagaimana semua ini bisa tercipta dan tentunya semua ini tercipta karena dunia yang semkin tua. Aku juga belajar dari para motivator dan founder teknologi seperti Elon Musk, Steve Jobs dan lainya. Mereka adalah orang hebat yang menjadi pendorong agar saya bisa mewujudkan mimpi ini semua. Aku juga sering mengikuti pelatihan kelistrikan yang diadakan lembaga-lembaga profesi, dari sisnilah aku belajar banyak sekali mengenai teknologi. dengan motto Mampu,Mau,dan Bisa, aku pari sukses. motto ini yang menjadi penyemangat ku. Aku mampu seperti mereka yang sukses karena mereka mampu dan seharusnya aku mampu juga. Aku Mau seperti mereka yang berjuang untuk sukses karena mereka mau berjuan dan seharusnya aku juga mau berjuang untuk sukses. Aku Bisa Sukses seperti mereka yang sukses karena mereka bisa seharusnya aku juga bisa. Dengan menanam benih mimpiku sejak saat ini aku yakin suatu saat akan memanen buahnya yang manis pada waktunya. Selanjutnya aku juga berpikir tidak selamaya kita bisa bekerja karena usia pasti akan menua dan tentunya tenaga tidak sekuat waktu muda, maka dari saat ini aku menyisihkan sebagian uangku untuk di Investasikan. Menurutku uang simpanan tidak bagus kalau kita istirahat uangnya juga istirahat maka dari ini aku berpikir uang ku harus bekerja dan berputar walaupun aku dalam keadaan istirahat.',	'Aku memiliki pengalaman yang cukup banyak khususnya di organisasi atau relawan. tapi disini aku akan membagikan ceritaku saat aku tinggal di Panti Asuhan dan aku disini belajar menjadi relawan untuk membantu Panti Asuhan yang lebih kekeurangan di banding Panti Asuhan kami. Cerita ini dimulai saat masa pandemi sampai saat ini. Seperti yang kita tahu Pandemi mulai menjangkit di Indonesia pada bulan Maret 2020, semua aktivitas diberhentikan, sebagian pekerjaan ditutup sementara dan bahkan imbasnya banyak perusahaan mem-PHK karyawannya karena covid 19 ini. Covid 19 juga sanggat berdampak buruk bagi kelangsungan Panti Asuhan Swasta ( berdiri sendiri ), bagaimana tidak Panti Asuhan swasta mendapatkan penghasilan untuk biaya hidup keluarga Panti Asuhan dari donatur yang datang ke Panti Asuhan. Tapi karena pembatasan dari Pandemi ini banyak donatur yang tak datang dan menyumbang untuk kebutuhaan Panti Asuhan. Sehingga banyak Panti Asuhan yang mengalami kesulitan dalam masa pandemi ini. Disinilah aku melihat peran kesaudaraan dan keluarga antar sesama Panti Asuhan. Pada awal pandemi aku menunjuk diriku untuk menjadi salah satu relawan untuk membantu Panti Asuhan yang mengalami kesulitan saat itu. Aku bersama tim relawan yang lain menyiapkan bahan sembako pokok seperti beras, indomie, teh, kopi, gula, minyak, alat kebersihan diaman sembako ini kami siapkan setiap sebulan sekali untuk dikirim ke panti-panti. Mungkin sebagian orang bertanya-tanya menapa kalian membantu orang lain disaat kalian juga sanggat butuh. Pertanyaan ini juga tersirat di benakku, mengapa kita bisa berbagi disaat kita sendiri sedang kesulitan. Pertanyaan ini pun aku tanyakan langsung ke bapak pimpinan Panti Asuhan, beliau menjawab dengan penuh percaya diri \" hidup itu bisa suka bisa duka,  kalau suka kita bersyukur kalau duka pun kita juga beryukur. tangan tidak boleh harus hanya di bawah, kita harus belajar untuk menjadi tangan yang diatas kita harus belajar memberi dalam keadaan seperti apapun. karena dengan memberi hidup kita akan menjadi bermanfaat, toh suatu saat juga siapa tau kita akan mengalami hal yang sama. Maka mulai saat ini tanamlah kebaikan Insyaallah Tuhan akan membalas kebaikan tersebut dengan hal indah yang lebih besar. Kata-kata inilah yang menjadi pendorongku untuk menjadi relawan untuk berbagi sesama Panti Asuhan selama Pandemi sampai saat ini. Walaupun ini merupakan pekerjaan relawan yang melelahkan tapi banyak hikmat dan makna yang banyak.',	1,	1654223689,	NULL,	0),
('SCHLR-BNTNR-d135dc',	'USR-BNTNR-3bd33',	'Binti Nuriyatul Muthi\'ah',	'2001-11-24',	'85648744590',	'Jalan perkutut, dusun Nglencong, desa Dempel, Kecamatan Geneng, Kabupaten Ngawi',	'Progam studi bimbingan dan pen',	'Institut Agama Islam Ngawi',	'3.40',	'2',	'Hanya manusia biasa yang ingin bermanfaat sepenuhnya untuk orang lain.',	'Bermanfaat bagi orang lain. Mewujudkan dengan menjadi manusia berpendidikan.',	'Ikut dalam organisasi kajian ilmiah, yang cenderung berkecimpung dalam kepenulisan dan kajian-kajian ilmiah',	1,	1654105130,	NULL,	0),
('SCHLR-BPDTY-e932af',	'USR-BPDTY-02e08',	'Bopi Aditya Kristianti',	'2003-04-19',	'8979747746',	'Desa kemiri rt05 01 Kecamatan Sumpiuh kabupaten Banyumas Jawa tengah',	'Akuntansi',	'Universitas Negeri Semarang ',	'3.87',	'2',	'Halo perkenalkan nama saya Bopi Aditya Kristianti,saya berasal dari Universitas Negeri Semarang dengan jurusan Akuntansi, Fakultas ekonomi tahun 2021. Saya lolos menggunakan Jalur SNMPTN,dan hobi saya adalah membaca dan bermain Bulutangkis. Saya anak ke 1 dari 4 bersaudara  dan hanya saya yang melanjutkan ke perguruan tinggi negeri. Saya sangat senang berkuliah meski jarak dari kedua orang tua sangat jauh. ',	'Mimpi terbesar saya adalah membahagiakan kedua orang tua saya,menjadi seorang akuntan profesional dan bisa membantu orang lain.',	'Saya memiliki begitu banyak pengalaman antara lain\r\n1. Menjadi anggota organisasi Daerah yaitu (Gama satria Banyumas)khusus mahasiswa universitas Negeri Semarang yang berasal dari semarang. \r\n2. Mengikuti kegiatan pengabdian masyarakat di desa terpencil selama 1 bulan \r\n3. Mengikuti kegiatan volunteer bersama anggota gama satria Banyumas \r\n4. Menjadi anggota EFL ( Economic Future Leaders) selama 1 tahun \r\n5. Mengikuti kegiatan sosialisasi kampus. ',	1,	1655562885,	NULL,	0),
('SCHLR-BYSNJ-0d0df8',	'USR-BYSNJ-6b170',	'Bayu Seno Aji',	'2003-04-16',	'89529945538',	'KP Gaga, Semanan, Kalideres, Jakarta Barat',	'IPS',	'SMAN 33 JAKARTA',	'2.64',	'5',	'Saya memiliki prestasi di bidang akademik seperti Medali Emas Bidang Ekonomi dalam PISA yang diselenggarakan oleh POSI tahun 2022, Medali Perunggu bidang Ekonomi dalam Olimpiade Sains Soedirman yang diselenggarakan oleh Garuda Sains Indonesia bersama Univ.Sumatra Utara tahun 2021, Medali Perunggu bidang Geografi dalam kegiatan Kompetisi Sains Indonesia yang diselenggarakan oleh POSI tahun 2021.\r\nSaya memiliki sifat leadership, tanggung jawab, disiplin, jujur, semangat tanpa menyerah, mencoba dan mencari pengalaman yang baru yang positif untuk saya dan sekitar saya.\r\nMemiliki kelebihan di bidang desain grafis, video editing, fotography, belajar web developing.\r\nMemiliki hobi olahraga futsal, renang, dan teknologi.\r\nMemiliki pengalaman bekerja di Shoppee di bagian sortir barang.\r\nPrestasi di bidang non akademik : kepanitiaan acara baik tingkat sekolah dan walikota.',	'Ingin membaktikan diri kepada kedua orang tua, masyarakat dan negara, dengan kemampuan akademik dan non akademik. Membangun usaha yang bisa menciptakan lapangan pekerjaan, serta membangun sekolah yang bisa bermanfaat untuk semua pelajar di daerah yang di dirikan sekolah. Serta berkesempatan untuk bisa melanjutkan pendidikan ke luar negeri\r\nCara saya untuk mewujudkannya :\r\nMenyelesaikan studi saya sampai gelar S1 bahkan saya niat melanjutkan S2\r\nMembangun relasi dengan orang-orang hebat yang dapat berdiskusi tentang hal softskill dan hardskill.\r\nBekerja di perusahaan selagi mengumpulkan modal untuk persiapan, serta ilmu dan pengalaman yang bisa didapatkan dan berguna.\r\nTerus berlatih dan belajar tentang hal yang baru, dan sekaligus mempelajari dengan fokus serta tanggung jawab penuh.',	'Iya saya punya banyak pengalaman, mulai dari menjadi anggota MPK SMAN 33 Jakarta tahun 2019-2020. Menjadi Wakil Ketua 1 MPK SMAN 33 Jakarta tahun 2020-2021. Menjadi ketua devisi bidang SDM ekstrakurikuler tahun 2020-2021. Ketua bidang Editing ekstrakurikuler Cinematograph tahun 2020-2021. Menjadi anggota MPK DKI Jakarta dan sekaligus pembuat logo MPK DKI Jakarta Sekarang ini.\r\nMenjadi Operasional Umum kepanitiaan Pentas Seni SMAN 33 Jakarta tahun 2021, menjadi ketua devisi kreatif dan desain dalam kegiatan School Creative Collaboration 2 bersama SUDIN Jakarta Barat.',	1,	1653809588,	NULL,	0),
('SCHLR-CHDJH-3916f4',	'USR-CHDJH-2e458',	'Chodijah',	'2003-11-14',	'8990043508',	'Demang 7, Ilir barat 1, Lorok Pakjo, Palembang, Sumatera Selatan ',	'Ekonomi Syariah/ Fakultas Ekon',	'UIN Raden Fatah Palembang ',	'3.53',	'1',	'Saya seorang mahasiswi UIN Raden Fatah Palembang, prodi Ekonomi Syariah. Saya memiliki ketertarikan dalam mengeksplor sesuatu yang baru dengan  berkomunikasi dan bersosialisasi sehingga saya suka berkontribusi dalam sebuah organisasi.',	'Mimpi terbesar saya adalah menjadi rektor \r\nCara mewujudkannya yaitu saya harus menyelesaikan perkulihan S1,S2,S3, dan sampai mengambir gelar Profesor, selain itu mencari relasi sangatlah penting sebagai membuka wawasan dan saling support,  maka dari itu saya akan gigih dalam mencari ilmu akademis dan ilmu kehidupan dengan relasi. ',	'Alhamdulillah saya dipilih menjadi divisi humas dalam Volunteer Fidea, dan saya mengikuti Volunteer Layar Hati Palembang, disana saya bertugas sebagai divisi logistik, adapun organisasi-organisasi yang saya ikuti  seperti: Lembaga Akuntansi dan Bisnis Syariah (LABS) UIN Raden Fatah Palembang, Himpunan Mahasiswa Program Studi Ekonomi Syariah, UIN Raden Fatah Palembang, Menjadi kepala departemen PSDM Organisasi Karya Ilmiah Remaja (KIR) SMAN 2 PALEMBANG, dan  Organisasi Rohis SMAN 2 Palembang',	1,	1654688962,	NULL,	0),
('SCHLR-CHMDR-552cf8',	'USR-CHMDR-84953',	'Achmad Rifqi',	'2003-01-17',	'8595520287',	'alasangker, jinengdalem, kec. buleleng kab. buleleng, Bali',	'Teknologi Rekayasa Perangkat L',	'Universitas Pendidikan Ganesha',	'3.61',	'1',	'Hallo, saya achmad rifqi dan saya sekarang umur 19 tahun yang dimana saya sekarag sebagai seorang mahasiswa di univerista negeri di bali, dan saya orangnya adalah orangg yang cenderung introvert tetapi saya bisa berbucara dengan orang orang dan saya juga orang yang sangat peduli dengan lingkungan sekitar dan saya lebih percaya diri.',	'mimpi terbesar saya pada saat itu adalah membuat orang tua saya bangga dengan saya keterima di universitas negeri dan saya dari situ mulai belajara secara terus meneuru agara saya bisa melanjutkan studi saya ke jenjang prkuliahan yang dimana saya awalnya adalah smk yang dimana tidak mendapatkan materi pembelajaran buat belajar sbmptn dan saya selama berbulan-bulan belajar dengan tekun agar bisa masuk ke universitas negeri dan saya sekarang berhasil.',	'ketika saya kuliah sekarang ini sampai dengan semester 2 ini saya memiliki pengalaman di kepanitian kampus dan saya sudah mengikuti beberapa kepantiann di kampus saya dan saya sekarang di semester 2 ini mau ke semester 3 ini saya mengikuti organisasi di lingkungan jurusan saya. ',	1,	1654533135,	NULL,	0),
('SCHLR-CHMDW-a0a9db',	'USR-CHMDW-e7455',	'Achmad Wikandaru',	'2003-11-29',	'87810221605',	'Perum Bintang Regency Blok O21 08/06 Jabungan Bnyumanik Semarang',	'Teknik KimiaTeknik',	'Univesitas Negeri Semarang',	'3.41',	'2',	'Saya adalah mahasiswa semester 2 Teknik Kimia Universitas Negeri Semarang. saya senang belajar disana karena saya dapat belajar banyak mengenai teknologi - teknologi terkini dalam bidang sumber daya alam terbarukan dan industri. saya merupakan pribadi yang gigih dalam berusaha, mudah beradaptasi, dan pantang menyerah denga keadaan. hal tersebut saya dapatkan ketika nenek saya terkena stroke 6 bulan yang lalu, dan disusul ibu saya yang mengalami stroke ringan 2 bulan yang lalu. ',	'mimpi terbesar saya adalah lulus dari teknik kimia dengan predikat cumlaude dan mendapat jenjang karir yang bagus. saya juga bermimpi untuk bisa mengabdi pada masyarakat di desa tempat aku dibesarkan, baik dengan pengajaran maupun dengan pelatihan secara langsung. Tentunya mengenai pentingnya teknologi yang semakin berkembang di era ini.',	'saat saya SMA, saya mengikuti kegiatan palang merah remaja tingkat kabupaten. disana saya mendapatkan banyak pengalaman mengenai kepalangmeraha dan relawan, apalagi pada saat tersebut kasus covid - 19 sedang banyak banyaknya, sehingga peran relawan sangat dibutuhkan dalam tindakan dan edukasi untuk msyarakat sekitar.',	1,	1654403766,	NULL,	0),
('SCHLR-CHNDR-2b8755',	'USR-CHNDR-c2348',	'Chandra Satya Bintara',	'1999-04-03',	'85382544809',	'Padat Karya Street, No.57, Rt.17, Rw.01, Kel.Srimulya, Kec.Sematang Borang, Palembang, Sumatera Selatan',	'communication science',	'Mercu Buana Yogyakarta Univers',	'3.85',	'2',	'Which I respect YBB Foundation. \r\nlet me introduce myself. I am Chandra Satya Bintara, a young man born in Sumatra with Javanese descent. I am currently 23 years old. I just continued my education at the University after I graduated in 2016, because at that time I took part in the selection to become a cadet in the hope that I could devote myself and study at the expense of the state. On the sidelines of my registration I improved my English skills at Kampung English Pare in Kediri. I am currently in semester 2 with a concentration in Public Relations. and I\'m currently taking a short semester from Gadjah Mada University collaborating with the Indonesian Digital Marketing Association in developing beginner business skills. I have an interest in learning and self development. especially in the context of public speaking, English, Mandarin, Digital Marketing, Negotiation, web design and other skills that can benefit many people. \r\n\r\nThank you for the opportunity that has been given. \r\nwhich I respect YBB Foundation.\r\n\r\nPermission to share the experiences of organizations and volunteers that I have participated in and are currently participating in.\r\nat this time I am a member of the Indonesian digital marketing association which focuses on support and facilities in developing novice businessmen. with training, mentoring related to digital marketing such as web processing through wordpress, landing pages, advertising, SEO, SEM, and sales distribution.\r\n\r\nMy experience in volunteering was when my colleagues and I participated in the program at Kampung Inggris Pare in Kediri. we set up a study group in an effort to introduce early English for colleagues in NTT online through a whatsapp group called \"English For Beginners (EFB)\" which lasted for 1 month. at that time I held the Speaking division of a total of 3 divisions (speaking, writing and grammar).\r\n\r\nThank you for the opportunity that has been given.\r\nYours faithfully\r\nChandra Satya Bintara\r\nChandra Satya Bintara',	'which I respect YBB Foundation.\r\n\r\nPermission to convey my biggest dream, I dream of becoming a youth figure who can be used as a reference for other colleagues out there, that age does not limit and is not the main stigma in success. because success is an ongoing effort. Based on that, I dream of becoming one of the speakers in the public relations division of the Indonesian National Armed Forces.\r\n\r\nThe efforts I made after I was declared not to have passed the cadet selection. I continued my education at Mercu Buana University Yogyakarta majoring in communication science and concentration in public relations. Besides that, I developed my English skills in the English village of Pare and became a volunteer English teacher for beginners with my colleagues, as a form of implementation of the knowledge we had gained.\r\n\r\nIn addition, I developed my public speaking skills. so that in the first semester of the annual communication day event at the faculty, I won first place. another act in my development following an additional semester from Gadjah Mada University.\r\n\r\nAnd the YBB Foundation with its scholarship program, I hope that I can take part in the YBB program, and become one of the young people who develop and benefit from the program that will be given to the wider community.\r\n\r\nThank you for the opportunity that has been given.\r\nYours faithfully\r\nChandra Satya Bintara',	'which I respect YBB Foundation.\r\n\r\nPermission to share the experiences of organizations and volunteers that I have participated in and are currently participating in.\r\nat this time I am a member of the Indonesian digital marketing association which focuses on support and facilities in developing novice businessmen. with training, mentoring related to digital marketing such as web processing through wordpress, landing pages, advertising, SEO, SEM, and sales distribution.\r\n\r\nMy experience in volunteering was when my colleagues and I participated in the program at Kampung Inggris Pare in Kediri. we set up a study group in an effort to introduce early English for colleagues in NTT online through a whatsapp group called \"English For Beginners (EFB)\" which lasted for 1 month. at that time I held the Speaking division of a total of 3 divisions (speaking, writing and grammar).\r\n\r\nThank you for the opportunity that has been given.\r\nYours faithfully\r\nChandra Satya Bintara',	1,	1654776066,	NULL,	0),
('SCHLR-CHNTY-605dea',	'USR-CHNTY-3e81f',	'Chintya Maulini ',	'2005-05-01',	'89512612201',	'Jalan Pendawa Lorong Bima No.227 Kecamatan Ilir Timur II Kota Palembang Sumatera Selatan ',	'Komunikasi ',	'Universitas Pertamina ',	'8.99',	'0',	'“Setiap anak pantas mendapatkan dan meraih mimpi setinggi apa pun yang ia inginkan, meski anak tersebut berasal dari daerah terpencil sekalipun.” Salah satu kutipan buku best seller 2020 berjudul MY CLOUD, bercerita. Saya Chintya Maulini, penulis novel solo MY CLOUD dan berpartisipasi dalam lebih dari 10 buku antologi nasional. Berkomitmen besar dalam pendidikan dan pengembangan anak muda, saya berkolaborasi aktif sebagai Mitra Muda UNICEF Indonesia dan sedang mengembangkan yayasan @Youth\'sSupport. \r\n\r\nDalam menggalakkan semangat Millenials di masa digitalisasi, mendapat undangan dalam Girls in ICT 10th Anniversary High-level engagement segments UN Indonesia sebagai Juara 2 lomba Girls in ICT 2021, saya juga berhasil meraih predikat Verbal Mention in UNESCO Awards pada 7th Conference of YISMUN (Youth International Summit Model United Nations) 2021. Sederet prestasi tersebut membawa saya menerima penghargaan Pemuda Berprestasi 2021 yang diberikan langsung oleh Dinas Pemuda dan Olahraga Provinsi Sumatera Selatan. \r\n\r\nAda harapan besar yang menjaga semangat saya, dimana ayah saya yang merupakan lulusan SMA dan berjuang mencari nafkah sebagai seorang driver Ojek (offline dan online) dengan penghasilan yang tidak menentu, serta ibu sebagai ibu rumah tangga saja, sedangkan saya anak pertama dari 2 bersaudara, dengan adik yang masih berusia 6 tahun. Setiap kegiatan saya niatkan untuk mereka, berharap sedikit dapat membantu meringankan beban perekonomian keluarga, misalnya dari berkah hadiah kemenangan lomba, sebagaimana yang saya sebut sebagai ‘Pemuda Punya Karya’. Karenanya, bahaya pandemi ini tidak boleh menjadi alasan para pemuda untuk berhenti berkarya meskipun banyaknya ujian yang melanda, kebutuhan keluarga semakin sulit terpenuhi pada pertengahan 2020 hingga 2021 dan membuat kami berpuasa serta membagi 1 makanan untuk sekeluarga. Dengan pandemi juga saya berprogres berjuang dan dipercaya menjadi freelancer cover book designer pada sebuah penerbitan independen Indonesia dan berkesempatan diundang oleh Universitas Aisyiyah Yogyakarta untuk membawakan materi yang cukup complicated, yaitu ‘Ketika Aku Menyukaimu, Aku Akan Mengejarmu(impian)’ dengan bahasan utama cita-cita dan masa depan.',	'\"Labaikallah humma labaik,\" Bacaan talbiyah senantiasa dituturkan ibu saya setiap sorenya. Saya bertekad untuk mewujudkan impian orangtua saya melihat Ka\'bah dan menebar kebermanfaatan untuk mewujudkan mimpi orang-orang yang membutuhkan. Memahami bagaimana sulitnya memenuhi kebutuhan sehari-hari, saya berharap dapat membuka lapangan pekerjaan bagi para tulang punggung keluarga, serta menyediakan yayasan pendidikan bagi disabilitas dan pelajar yang tidak bisa merasakan bangku sekolah karena keterbatasan ekonomi keluarga. Karenanya, saya bergabung dalam sejumlah kegiatan kerelawanan untuk belajar dan menambah pengalaman, saya berjuang untuk terkoneksi dengan sejumlah relasi sebagai jembatan mendukung SDGs ke 17 yaitu Partnership for the Goals yangmana berdampak pada mimpi besar saya. Membuka usaha CoverBook shop dan tergabung dalam organisasi nasional sejak masa putih biru, saya belajar memanajemen waktu dan kepemimpinan dengan baik untuk mempersiapkan diri membersamai tim, agar senantiasa menambah kebermanfaatan seiring suksesnya yayasan dan perusahaan yang didirikan. Terseleksi menjadi mahasiswa baru program studi Komunikasi 2022, saya berharap dapat menjembatani langkah saya mewujudkan mimpi besar saya, belajar, dan semakin menebar kebermanfaatan.\r\n\r\nAware of importance of taking a part in supporting renewal of advanced Indonesia, I kept trying to be a good practitioner, impact on future generations. Sebagaimana melihat beasiswa ini memiliki peran yang besar dalam pengembangan anak muda, pendidikan dan budaya, serta hubungan internasional. Saya pun meyakini hal yang sama, yaitu pengembangan dan kontribusi anak muda Indonesia harus terus diupayakan, seiring dengan laju pendidikan global yang terus maju, I aim to make a difference in my community.\r\n\r\nSelain memahami keterampilan, college life, dan career plan lebih dalam, saya berharap dapat memaksimalkan potensi saya untuk menebar kebermanfaatan bagi masyarakat secara berkelanjutan melalui program ini.  Sebagaimana beasiswa ini bukan hanya sangat berdampak bagi saya untuk menunjang pendidikan saya, juga bermanfaat bagi progres pengembangan anak muda di Indonesia. Saya memiliki komitmen yang kuat untuk mengembangkan self-leadership anak muda untuk mempersiapkan prospeknya yang relevan dunia global, dengan rancangan sebuah forum YOURFRIENDS yang akan saya buat untuk membangun dan memperkenalkan sistem pembelajaran media interaktif. Mengenal lebih dalam mengenai perancangan dan pengembangan produk inovatif disertai peningkatan kapasitas anak muda, melalui sesi pelatihan beasiswa ini akan sangat berguna bagi saya dalam mencapai kemajuan yang efektif dalam riset yang saya harapkan dapat bermanfaat bagi masyarakat sekitar. Sehingga menjadi awardee program ini akan membantu saya memastikan ruang lingkup yang kolaboratif dengan keseimbangan yang lebih baik antara kemampuan akademik dan karakter untuk generasi muda Indonesia.',	'Untuk kegiatan dan organisasi, berikut Chintya bergabung dan berpartisipasi dalam sejumlah organisasi, komunitas, dan kegiatan relawan:\r\n•Rohis SMAN Sumatera Selatan, as the coordinator of Softskill division 2020/2021 dan melanjutkannya sebagai anggota divisi Keputrian 2021/2022. Alhamdulillah saat kelas 10, Chintya dipercaya sebagai koordinator kelas tilawah. Saat kelas 11, Chintya diamanahkan untuk lanjut pada divisi Keputrian yang dedikasinya pada kehidupan berasrama di SMAN Sumatera Selatan, sekaligus ketua tahsin salah satu kelompok yang telah dibagi kepala asrama. Selama periode rohis, Chintya juga diberi amanah dalam membersamai temen-temen sebagai ketua mentoring 2020-2022 yang menjadi penghubung antara guru pembimbing dan temen-temen.\r\n\r\n•Decoration Team SMAN Sumatera Selatan 2019/2020. Decoration Team ini ada tim khusus dekorasi dan seni untuk berbagai acara SMAN Sumatera Selatan nih Kak, salah satu proyek besar kami yaitu proyek tutorial pembuatan poster yang alhamdulillah sudah dipublikasikan di sosial media SMAN Sumatera Selatan, juga dalam dekorasi graduation Kakak 9th SMANSS tetapi sedikit terkendala karena pandemi hingga akhirnya tim kami memproduksi dan mempersiapkan presentasi dan berbagai media yang akan digunakan untuk online graduation Kakak 9th SMANSS nih Kak, hehe.\r\n\r\n• Ketua divisi aspirasi, MPK SMAN Sumatera Selatan 2020/2021. Sebagaimana divisi aspirasi ini bertugas untuk mengelola sosial media dan desain MPK, menjadi jembatan antara siswa dan guru serta organisasi, dan memproses lomba-lomba pada hari-hari besar, Chintya banyak belajar untuk mengkonsep dan memproduksi segala keperluan desain dan media MPK, menjadi jembatan antara siswa dan internal sekolah, serta mengelola proyek lomba-lomba yang diadakan di internal sekolah nih Kak, seru banget hehe boleh juga mampir di @classunionsmanss_ nih Kak kiranya kakak berkenan. Sebagai ketua, Chintya juga belajar banyak banget gimana memanage waktu dan pembagian tugas membersamai adik-adik anggota MPK.\r\n\r\n•Tim Media dan Komunikasi, Forum MPK Nasional 2020/2021. Alhamdulillah Chintya diberikan kesempatan untuk menjadi representative dari sekolah dan provinsi Sumatera Selatan dalam Forum MPK Nasional. Selain mengelola sosial media MPK Nasional, tim kami juga mengelola dan sering bersama teman-teman anggota MPK seluruh Indonesia dalam sebuah grup WhatsApp, baik dalam program MAKRAB(Malam Keakraban), maupun kering secara fleksibel bersama teman-teman di grup.\r\n\r\n•Editor dan Koordinator program Community Service SMANSS 2020. Di sini merupakan wadah bagi Chintya untuk menjadi jembatan nih, Kak, dalam rangka menyatukan berbagai dokumentasi teman-teman anggota dalam bentuk poster dan presentasi final dalam program community service yang kebetulan kemarin diselenggarakan secara online akibat pandemi. \r\n\r\n•Anggota humas dan sosialisasi KOPPETAHAM Sumatera Selatan 2020/2021. Komunitas Pelajar Penggiat HAM (KOPPETAHAM) ini merupakan forum pelajar Sumatera Selatan yang melindungi hak asasi manusia dan mengupayakannya, Chintya dan temen-temen berpartisipasi dalam beberapa project seperti Instagram live, moderator acara KOPPETAHAM yang mana dinaungi langsung oleh Kementerian Hukum dan HAM provinsi Sumatera Selatan, serta menjadi penghubung antara internal anggota dan berkoordinasi bersama divisi acara dan divisi lainnya \r\n\r\n•CIMB EDUSHIP forum pendidikan Indonesia Millenial Connect 2020 dan SEMAR Campaign dalam Universitas Sebelas Maret program 2021, as the volunteer. Dalam acara ini, Chintya dan temen-temen volunteer membagikan atau menyebarkan konten kegiatan acara dan poster untuk meramaikan acara melalui sosial media pribadi dan dan membuat grup sosialisasi, kami juga berpartisipasi dalam sejumlah seminar yang diadakan secara online dengan berbagai pembicara hebat nih alhamdulilah Kak\r\n\r\n•Volunteer #GenerasiMudaGenerasiPerubahan EDUFOTA. Menjadi volunteer program yang menyuarakan gerakan dan kampanye anti korupsi secara online ini ditujukan untuk mengedukasi masyarakat tentang bahaya korupsi, baik dengan games yang di-share secara daring melalui Instagram dan berbagai konten yang juga disaring di media sosial kita nih Kak, program ini berlangsung pada Juli 2020 \r\n\r\n•National Speaker:\r\n-Pembicara pada acara kajian islami yang diadakan Mahkota Muslimah Jatim dan Komunitas Lentera Hijrah Akhwat 2020, Chintya sering bersama teman-teman mengenai topik Muslimah Milenial Berkarya Sesuai Zaman. \r\n-Narasumber bedah buku bersama forum literasi Muzayyanah dan LIPVI Indonesia, Chintya mengadakan bedah buku pertama Chintya yang berjudul MY CLOUD.\r\n-Pembicara pada webinar universitas Aisyiyah Yogyakarta, membawakan topik mengenai partisipasi dan cara belajar yang baik dikala pandemi.\r\n-Pembicara Webinar umum yang diadakan oleh forum OSIS Sumatera Selatan, \"Find Your Own Self By Upgrading Your Softskill\" pada tahun 2021 yang merupakan kolaborasi program Mitra Muda UNICEF Indonesia \r\n\r\n•Graphic designer at GGP Publisher dan redaksi Booklovers. Alhamdulillah Chintya diberi kesempatan menjadi tim book jacket designer di salah satu penerbit buku indie Indonesia yaitu GGP Publisher. Chintya banyak belajar banget nih Kak, di sini, untuk memahami konsep desain dan ide yang diberikan penulis dengan berbagai genre.\r\n\r\n•Duta U-Report UNICEF Indonesia, Chintya terseleksi menjadi salah satu duta yang bertugas sebagai social media support dan berpartisipasi dalam berbagai project U-Report dan UNICEF. Program ini berlangsung dari Mei 2020 dan masih berlanjut\r\n\r\n• Mitra Muda UNICEF INDONESIA 2021-Present (pada kesempatan ini, Chintya terseleksi dan berkolaborasi dalam sejumlah program UNICEF Indonesia yang tergabung dengan berbagai diskusi bersama Kementrian Keuangan RI melalui project dan presentasi analisis diseminasi keuangan berorientasikan anak, kolaborasi bersama Universitas Gadjah Mada,Y20 FGD for Indonesian Summit2022, produksi beberapa podcast dan diamanahkan menjadi fasilitator acara Youth Skills Event 2021). Chintya pula berpartisipasi dalam sejumlah konferensi, seperti kampanye hari kartini, Kindness Leader chapter Sumatera Selatan, workshop Children\'s Climate and Enviromental Right, serta #GenerasiTerampil\r\n\r\n•ID Next Leader Local Ambassador for Y20. Chintya terseleksi menjadi Local Ambassador untuk mendukung kegiatan Y20, menekuni isu utama kegiatan Y20 Indonesia 2022 dan menggalakkan kegiatan kepemudaan, reduced Inequalities, digitalisasi, dan pendidikan berkelanjutan.\r\n\r\n•Publikasi\r\n-Press Conference U-Report Indonesia, UNICEF Indonesia youth forum. https://indonesia.ureport.in/story/1034/\r\n-Kontributor pada media TUGU JATIM.id -https://tugujatim.id/seorang-juara-bukan-hanya-persoalan-piala/\r\n-https://tugujatim.id/atma-luar-biasa/\r\n-Artikel GIRLS IN ICT Indonesia, collaborated with UN Indonesia - https://goresanpenachintya.wordpress.com/2021/04/19/3m-dalam-tik-dan-perempuan-sebagai-agents-of-change/\r\n-Kontributor newsletter SMAN Sumatera Selatan - http://smansumsel.sch.id/index.php/about-us/newsletter/book/31?page=16',	1,	1655710968,	NULL,	0),
('SCHLR-CHRST-92b5dd',	'USR-CHRST-59c08',	'Christian Ambrosius Diaz',	'2003-01-01',	'895603770252',	'CT Kost Putra Jln Kali Pandega Marta no 730, RT 7 RW 47, Pogung Lor, Sinduadi Mlati Sleman Yogyakarta Kode Pos 55824',	'Jurusan Farmasi  Fakultas Farm',	'Universitas Gadjah Mada',	'3.90',	'4',	'Nama saya Christian Ambrosius Diaz. Sebagai seorang generasi muda, saya memiliki ketertarikan yang tinggi dalam bersosialisasi dengan orang lain dan mengeksplorasi hal-hal baru di sekitar saya yang dapat mendukung saya untuk lebih berkembang, seperti dengan mengikuti berbagai komunitas maupun organisasi. Selain itu, saya juga orang yang pekerja keras, di mana saya akan berusaha menyelesaikan tugas saya sebaik yang bisa lakukan karena saya tidak ingin mengecewakan kepercayaan yang sudah diberikan kepada saya. Dalam mengerjakan tugas, saya juga seorang yang perencanaan. Berbagai pekerjaan yang ada akan lebih mudah untuk saya kerjakan jika sudah dibuat perencanaannya terlebih dahulu mengenai tugas mana yang harus dikerjakan sesuai urutan kepentingannya. Meskipun demikian, dalam mengambil keputusan terkadang saya menjadi kurang tegas sehingga menjadi bimbang untuk membuat pilihan. Akan tetapi, saya terus belajar untuk mengatasi kekurangan ini dengan meningkatkan kepercayaan pada keputusan sendiri.',	'Mimpi terbesar saya yaitu saya ingin menjadi orang yang dapat membantu dunia berubah menjadi lebih baik lagi. Dalam hal ini, saya bermimpi untuk memberi uluran bagi masyarakat khususnya yang tersingkirkan dan kurang mendapat perhatian untuk mencapai taraf kehidupan yang lebih baik. Cara saya mewujudkannya yaitu pertama-tama saya akan fokus menjalani pendidikan saya untuk memaksimalkan potensi yang saya miliki agar kelak saya dapat memberi dampak positif bagi masyarakat luas. Selain itu, saya juga akan memperluas relasi saya karena dengan relasi yang luas saya percaya bahwa saya dapat bekerja sama dengan orang-orang lain dengan tujuan yang sama sehingga perubahan positif yang dapat diberikan kepada masyarakat semakin besar pula.',	'Pada beberapa pengalaman sebelumnya, saya pernah aktif di beberapa organisasi dan volunteer, khususnya pada posisi public relation. Secara umum, melalui pengalaman organisasi dan volunteer tersebut saya dapat bekerja sama dengan orang-orang dengan tujuan yang sama melalui pelaksanaan program kerja secara fokus dan interaktif.\r\nSecara lebih khusus, melalui pengalaman tersebut saya mempelajari banyak hal tentang cara berkomunikasi yang baik dan efektif dengan beberapa pihak seperti tamu undangan maupun juga narasumber untuk kepentingan acara webinar, seperti dosen dan psikolog. Pada kesempatan lain, saya juga pernah menjadi penghubung dengan berbagai media partner untuk kepentingan publikasi serta membantu menyusun MoU untuk kepentingan kerjasama dengan media partner. Selain itu, saya beberapa kali menjadi staff divisi fundraising di beberapa kepanitiaan dan bertanggung jawab dalam membangun kerja sama dengan beberapa sponsor serta membantu menyusun proposal kerjasama. Pada kesempatan yang lain, saya pernah menjadi staff divisi partnership dan bertugas dalam menjalin kerjasama dengan komunitas/platform lain untuk menjalankan program kolaborasi event serta berdiskusi untuk menentukan kontraprestasi dan kesepakatan kerjasama yang tepat. Melalui kesempatan tersebut, saya belajar banyak hal mengenai cara komunikasi yang efektif dan mampu menarik perhatian konsumen. \r\nSaya pernah menjadi staff divisi public relation (baik organisasi dan volunteer) di Yayasan Peduli Pendidikan Indonesia, Helpedia Indonesia, Kelas Ragam, Treehome Bali, Fasmart Education, Kudu Pintar, Psycofarm, Awesome Language Stability, U-Preneurs, Futureglow Up. Selain itu, hingga saat ini saya juga masih aktif sebagai staff Departemen Pengabdian Masyarakat di  Jaringan Mahasiswa Kesehatan Indonesia Fakultas Farmasi Universitas Gadjah Mada.',	1,	1655117211,	NULL,	0),
('SCHLR-CHSNL-a7d9dc',	'USR-CHSNL-35166',	'Chusnul Adisty Cahyanita ',	'2003-10-19',	'85894248309',	'Kp.Selon 01/03 Ds.Kaliasin Kec.Sukamulya Kab.Tangerang Banten',	'S1 Akuntansi',	'Universitas Sultan Ageng Tirta',	'3.30',	'1',	'Saya Chusnul adisty cahyanita kuliah jurusan akuntansi di Universitas Sultan Ageng Tirtayasa\r\nSaya mempunyai tekad yang kuat dan bertanggungjawab dibuktikan dengan aktif dalam kegiatan berorganisasi di kampus\r\n',	'Membahagiakan orang tua, mempunyai banyak teman dan bisa menggapai cita-cita yang saya impikan\r\nDengan Mimpi tersebut saya akan giat, rajin, semangat, tekad dan niat yang kuat untuk mewujudkan mimpi tersebut ',	'Pengurus OSIS MAN 4 Tangerang tahun 2019-2020\r\nKerani Putri Ambalan Nyimas Gamparan 12.092 Basis MAN 4 Tangerang tahun 2020\r\nPengurus HMJ Akuntansi 2022\r\nAnggota Magangers Kestari Tirtayasa research and academic society 2022',	1,	1655264896,	NULL,	0),
('SCHLR-CHWNF-fd3497',	'USR-CHWNF-c164f',	'ICHWAN FIRDAUS',	'2003-01-08',	'81284636095',	'Jalan Sultan Hasanuddin pandan kasturi II, RT 3 / RW 11, Ambon, Maluku',	'Jurusan sosiologi, fakultas il',	'Universitas pattimura',	'3.70',	'2',	'Nama saya Ichwan Firdaus, saya lahir di Jakarta, 8 Januari 2003, saat ini saya sedang berkuliah di universitas pattimura, Ambon, maluku. Saya mengambil prodi sosiologi fakultas ilmu sosial dan ilmu politik, sekarang saya sudah menempuh di semester 2.',	'Mimpi terbesar saya bisa lulus dengan cepat dengan hasil yang memuaskan, dan bisa lulus cpns yang akan mendatang setelah saya lulus kuliah, cara mewujudkannya saya belajar sungguh sungguh dan fokus untuk menyelesaikan studi saya',	'Saya belum mempunyai pengalaman di organisasi',	1,	1653554074,	NULL,	0),
('SCHLR-CMLYW-c23780',	'USR-CMLYW-c5c12',	'Camelia Ayu Wulandari',	'2004-04-29',	'81236430473',	'Jalan A.H Nasution, Aeramo, Aesesa, Nagekeo, Flores,Nusa Tenggara Timur',	'Pendidikan dokter, Fakultas Ke',	'Universitas Nusa Cendana',	'3.14',	'1',	'Nama lengkap saya Camelia Ayu Wulandari,biasa dipanggil Ayu,saya dilahirkan pada 29 April 2004 di Surabaya, namun saya di besarkan dan berdomisili di Mbay ,NTT. Saya merupakan anak pertama dari tiga bersaudara, dibesarkan dari keluarga sederhana yang berharap anak-anak nya bisa berpendidikan tinggi. Saat ini saya MABA, saya lulus di Fakultas Kedokteran Universitas Nusa Cendana melalui jalur SNMPTN. ',	'Impian terbesar saya ialah menjadi seorang dokter yang mahir agar dapat menyelamatkan banyak orang ,cara saya untuk mewujudkannya yaitu dengan belajar sebaik mungkin,banyak ikut kegiatan organisasi, senantiasa beribadah,dan memperbanyak prestasi agar bisa menjadi seorang dokter hebat.',	'Saya pernah mengikuti kegiatan Jambore,maupun ekstrakulikuler kegiatan kepramukaan disitu jiwa kemandirian saya, bekerja sama, berkomunikasi saya meningkat. Kegiatan Tersebut saya lakukan dari sekolah dasar hingga sekolah menengah atas. Saya pun sering mengikuti kegiatan bakti sosial yang diselenggarakan oleh beberapa lembaga.',	1,	1654417229,	NULL,	0),
('SCHLR-CNDPT-fe49d4',	'USR-CNDPT-1bfa5',	'CINDI PUTRI BERLIANA',	'2003-06-19',	'81335713801',	'Banjar RT 05 RW 02, Desa Purwosuman, Kecamatan Sidoharjo, Kabupaten Sragen, Jawa  Tengah',	'Prodi Akuntansi Fakultas Ekono',	'Universitas Negeri Semarang',	'3.67',	'1',	'Perkenalkan nama saya Cindi Putri Berliana, saat ini saya sedang menempuh pendidikan S1 Program studi Akuntansi, Fakultas Ekonomi, Universitas Negeri Semarang. Saya tertarik dalam dunia akuntansi, keuangan, perpajakan, pendidikan, dan teknologi. Saya adalah orang yang disiplin, melalui kedisiplinan ini saya mampu memperoleh juara dua dari seluruh siswa IPS di SMA N 3 SRAGEN pada tahun 2018 dan berhasil memperoleh juara satu dari seluruh siswa IPS di SMA N 3 SRAGEN pada tahun 2019-2020. Saya juga dapat bekerja secara individu ataupun kelompok, dengan bekerja secara berkelompok dapat menghasilkan ide yang lebih luas dan spesifik sehingga hasil yang diperoleh lebih maksimal dan profesional. Saya menyukai tantangan dan mempelajari hal-hal baru, hal ini membuat saya mudah beradaptasi dengan lingkungan baru. Saya memiliki keahlian dalam penggunaan Microsoft Office seperti Microsoft Word, Microsoft Excel, dan Microsoft Power Point. Saya menggunakan Micrososft Excel untuk pembuatan jurnal hingga laporan keuangan. Saya juga mampu menggunakan aplikasi canva untuk pembuatan desain dan power point.',	'Ketika saya berhasil lolos masuk SMA N 3 SRAGEN, saya bercita-cita untuk lolos SNMPTN karena hal itu akan memudahkan saya dalam hal keuangan nantinya. Saya bertekad untuk melakukan apa yang sebelumnya belum pernah saya lakukan yaitu berani mengutarakan pendapat saya didalam kelas, memanajemen waktu antara sekolah, organisasi, dan bimbingan belajar, serta mengikuti berbagai perlombaan seperti OSN Ekonomi tahun 2019 serta lomba penyiar radio. Beragam kegiatan yang saya ikuti namun nilai saya tetap stabil dan berhasil menjadi juara umum jurusan IPS pada tahun 2019-2020. Atas tekad dan perjuangan saya akhirnya saya dinyatakan lolos Seleksi Nasional Masuk Perguruan Tinggi Negeri (SNMPTN) tahun 2021 di Universitas Negeri Semarang dengan jurusan yang saya impikan yaitu Akuntansi. \r\n\r\nSewaktu saya duduk dibangku sekolah dasar saya melihat teman-teman seusia saya mencari nafkah dijalan raya tanpa mengeluh akan panasnya sinar matahari disiang hari, berjalan tanpa menggunakan alas kaki ketika pergi ke sekolah, dan tidak ada waktu bermain dengan teman-temannya. Pada saat itu saya bertekad untuk menjadi manusia yang dapat memberikan warna dalam hidup mereka. Mimpi ini menjadi lebih kuat ketika saya duduk dibangku SMA dan perkuliahan. Oleh karena itu, saya mendaftarkan diri menjadi relawan tentor inspiratif Gerakan Mengajar Desa 2022 untuk mencapai mimpi saya tersebut. Pada bulan Mei 2022 saya dinyatakan lolos seleksi dan saat ini saya resmi menjadi anggota GMD 2022.',	'Selama menjalani satu semester dibangku perkuliahan ini saya mengikuti organisasi FOKUS (Forum Kajian Akuntansi) FE UNNES. Saya dipercaya untuk menjadi staff Human Resources Development. Saya juga dipercaya untuk menjadi panitia humas dalam acara Training PKM 2021 yang diselenggarakan oleh HIMA Akuntansi FE Unnes dan FOKUS FE Unnes. Saya melaksanakan tugas saya untuk menghubungi serta berkoordinasi dengan tamu yang diundang secara tepat waktu, mengumpulkan serta mendampingi peserta sebelum acara dimulai. Acara tersebut sukses dengan 135 peserta yang bergabung melalui jaringan online. Selama masa Sekolah Menengah Atas (SMA) saya mengikuti dua organisasi yaitu Rohani Islam (ROHIS) dan Jurnalistik. Saya menjadi staff Human Resources Development dalam dua organisasi tersebut. Pada tahun 2019, ROHIS menyelenggarakan Kajian Akbar. Sebagai panitia humas saya bertugas mengkoordinasikan mekanisme acara dengan para tamu undangan serta menyebarkan informasi acara seluas-luasnya agar target jumlah peserta tercapai. Acara tersebut sukses dengan lebih dari 300 peserta yang hadir. Pada bulan Mei 2022 saya lolos menjadi relawan tutor inspiratif Gerakan Desa Mengajar 2022. Gerakan Desa Mengajar merupakan gerakan pendidikan yang diinisiasi atas dasar kepedulian terhadap pendidikan di Indonesia. GMD memiliki beberapa program salah satunya adalah program pengabdian masyarakat, dimana para tentor inspiratif yang lolos seleksi akan ditraining terlebih dahulu sebelum terjun ke masyarakat. Pengabdian difokuskan di desa-desa wilayah Indonesia dan Sekolah Dasar (SD) yang berlokasi di desa.',	1,	1654349048,	NULL,	0),
('SCHLR-CNDYN-bed88d',	'USR-CNDYN-203b3',	'Cindy Anita sitanggang',	'2004-06-11',	'81262621042',	'Kebun sibabi, lingga raja ll, kecamatan pegagan hilir, sumatera utara .',	'Agrokeoteknologi',	'Universitas udayana',	'0.00',	'0',	'Pekenalkan nama saya cindy anita sitanggang biasa di panggil cindy sekarang saya umur 18 tahun sekarang saya tinggal di tiga baru sumatera utara. Saya lulusa SMA swasta di bawah naungan perguruan khatolik yang ada di daerah saya. Pada waktu sma nilai saya cukup dengan mendapatkan rank 10 besar di kelas,saya juga cukup aktif dalam kegiatan ekstrakulikuler di bidang non akademik yang di sedialan sekolah saya, tak dapat dipungkiri, saya juga memiliki kelemahan kurang percaya diri saat berbicara di depan orang banyak.Dan saya adalah seorang yang rajin dan tekun dalam melaksanakan pembelajaran saya. Terimakasih',	'Mimpi terbesar saya adalah saya ingin memiliki sebuah pekerjaan tetap di masa depan untuk membantu ekonomi keluarga saya dan membahagiakan kedua orang tua saya. Cara mewujudkanya mulai dari sma saya sudah berusaha agar nilai saya tetap stabil dan mendapatkan sebuah kursi di bangku kuliah salah satu ptn melalui jalur snmptn, yang di mana melalui itu saya harap minpi saya dapat tercapai nantinya.',	'Saya pernah menjadi anggota organisasi ekstrakulikuler di sekolah saya yaitu bola volly, ada banyak hal yang saya pelajari dan dapatkan bukan hanya tentang memukul bola tetapi juga bagaimana menghargai pendapat orang lain, kesabaran yang selalu di uji, dan kerja sama tim.',	1,	1654146923,	NULL,	0),
('SCHLR-CNMLN-d00f28',	'USR-CNMLN-d3c29',	'Cania Malinda Arroyo',	'2003-11-06',	'85783081931',	'Jl.Jendral Sudirman No.16, Pringsewu Selatan',	'IPS',	'SMAN 1 PRINGSEWU',	'0',	'0',	'Saya adalah anak pertama dari tiga bersaudara dan berasal dari keluarga yang sederhana, sejak duduk di bangku Sekolah Dasar saya hampir selalu mendapatkan peringkat kelas, kemudian saya memiliki minat dan bakat yang tinggi di bidang seni, khususnya seni lukis, karena ketertarikan tersebut saya beberapa kali memenangkan perlombaan melukis, dengan melukis saya mampu mengekspresikan diri saya dan menjadi lebih percaya diri. saya merupakan orang yang ambisius dan memiliki minat belajar yang tinggi dibuktikan dengan selalu mendapat peringkat kelas dan IP stabil ketika duduk di bangku SMA. saya merasa harus terus belajar seumur hidup karena belajar adalah kewajiban sebagai manusia agar senantiasa menjadi pribadi yang lebih baik, berwawasan serta bermanfaat.',	'Mimpi terbesar saya yaitu menjadi independent woman yang diwujudkan dengan cara terus belajar tidak hanya dalam hal akademik namun juga belajar di dalam kehidupan sehari-hari agar menjadi manusia yang berwawasan dan mempunyai pola pikir maju seiring berkembangnya zaman, kemudian dengan menentukan tujuan atau goals hidup kedepannya agar hidup menjadi lebih terarah, menghargai waktu karena waktu adalah hal yang tidak bisa di putar ulang maka dari itu manfaatkan tiap detiknya untuk menciptakan kebaikan, serta menjadi sosok yang menginspirasi banyak orang lewat prestasi dan pencapaiannnya',	'Saat saya bersekolah di SMAN 1 PRINGSEWU saya mengikuti organisasi olimpiade sekolah, berperan menjadi anggota adalah hal yang berharga bagi saya, karena saya bisa ikut serta mewakili sekolah dalam perlombaan olimpiade atau LCT, ilmu, relasi, dan pengalaman yang saya dapat membentuk saya menjadi orang yang lebih baik daripada versi diri saya sebelumnya',	1,	1655652799,	NULL,	0),
('SCHLR-CNMLN-e9b4ab',	'USR-CNMLN-d3c29',	'Cania Malinda Arroyo',	'2003-11-06',	'85783081931',	'Jl.Jendral Sudirman No.16, Pringsewu Selatan',	'IPS',	'SMAN 1 PRINGSEWU',	'0',	'0',	'Saya adalah anak pertama dari tiga bersaudara dan berasal dari keluarga yang sederhana, sejak duduk di bangku Sekolah Dasar saya hampir selalu mendapatkan peringkat kelas, kemudian saya memiliki minat dan bakat yang tinggi di bidang seni, khususnya seni lukis, karena ketertarikan tersebut saya beberapa kali memenangkan perlombaan melukis, dengan melukis saya mampu mengekspresikan diri saya dan menjadi lebih percaya diri. saya merupakan orang yang ambisius dan memiliki minat belajar yang tinggi dibuktikan dengan selalu mendapat peringkat kelas dan IP stabil ketika duduk di bangku SMA. saya merasa harus terus belajar seumur hidup karena belajar adalah kewajiban sebagai manusia agar senantiasa menjadi pribadi yang lebih baik, berwawasan serta bermanfaat.',	'Mimpi terbesar saya yaitu menjadi independent woman yang diwujudkan dengan cara terus belajar tidak hanya dalam hal akademik namun juga belajar di dalam kehidupan sehari-hari agar menjadi manusia yang berwawasan dan mempunyai pola pikir maju seiring berkembangnya zaman, kemudian dengan menentukan tujuan atau goals hidup kedepannya agar hidup menjadi lebih terarah, menghargai waktu karena waktu adalah hal yang tidak bisa di putar ulang maka dari itu manfaatkan tiap detiknya untuk menciptakan kebaikan, serta menjadi sosok yang menginspirasi banyak orang lewat prestasi dan pencapaiannnya',	'Saat saya bersekolah di SMAN 1 PRINGSEWU saya mengikuti organisasi olimpiade sekolah, berperan menjadi anggota adalah hal yang berharga bagi saya, karena saya bisa ikut serta mewakili sekolah dalam perlombaan olimpiade atau LCT, ilmu, relasi, dan pengalaman yang saya dapat membentuk saya menjadi orang yang lebih baik daripada versi diri saya sebelumnya',	1,	1655653017,	NULL,	0),
('SCHLR-CRNLS-e9dbd7',	'USR-CRNLS-04a86',	'Cornelius Saryadi Turnip',	'2002-08-30',	'87877219165',	'Jalan Mayor Salim Batu Bara Gg Melati No 37',	'S1 Akuntansi, Akuntansi, Fakul',	'Universitas Lampung',	'3.66',	'4',	'Seorang yang memiliki minat dan kemampuan menganalisis di bidang pasar modal.',	'Menjadi Pegawai BEI atau OJK. Fokus pada bidang pasar modal dengan memahami regulasi dan mekanisme yang ada di Pasar Modal.',	'Pada tahun ini, saya diamanahkan sebagai sekertasi bidang 2 (Penelitian dan Ilmu Pengetahuan serta Pengembangan Profesi) dengan memberikan edukasi kepada anggota maupun masyarakat umum untuk memperkenalkan pasar modal dalam meningkatkan literasi dan inklusi keuangan.',	1,	1654346921,	NULL,	0),
('SCHLR-CTFRY-f6d2f6',	'USR-CTFRY-12bc3',	'Cut Firyal Shafa',	'2003-02-23',	'85359944909',	'Jl. Tgk Di Beutong, Pasheu Beutong, Kec. Darul Imarah, Kabupaten Aceh Besar, Aceh 23233',	'Pendidikan Bahasa Inggris',	'MNC University',	'3.61',	'2',	'Nama saya Cut Firyal Shafa, saya berasal dari Aceh. Saya anak pertama dari 3 bersaudara, saat ini saya berkuliah di MNC University Jakarta semester 2, saya masih berkuliah jarak jauh via platform yang ada, saya sebelum kelas biasanya membaca materi yang akan dosen jelaskan, mencatat materi dan tugas yang di berikan oleh dosen, setiap di beri tugas kelompok setelah kelas saya membagi tugas masing-masing dan evaluasi setelah tugas tersebut sudah siap, saya pernah kerja part time di perusahaan Aceh.',	'Mendapat beasiswa S2 ke luar negeri.\r\n\r\nSaya mewujudkan dengan mencari informasi simulasi ujian ielts, untuk mengetahui kemampuan dan score ielts yang saya dapatkan sebelum ke tahap ujian yang sebenarnya, dan saya berlatih bahasa Inggris untuk memperdalam lagi kemampuan berbahasa Inggris saya.',	'Saya ikut organisasi tim sosmed MNC sebagai writer, dan lets MNC sebagai anggota humas.',	1,	1653722641,	NULL,	0),
('SCHLR-CTVPS-5917b1',	'USR-CTVPS-3a646',	'Octavia Puspitha Sari',	'2004-10-03',	'81379964656',	'Kecamatan Mesuji, Kabupaten Ogan Komering Ilir, Sumatera Selatan',	'Pendidikan Dokter',	'Universitas Bengkulu',	'0.00',	'0',	'Saya Octavia Puspitha Sari, yang saat ini merupakan mahasiswa baru prodi pendidikan dokter di Universitas Bengkulu. Selama 3 tahun di SMA, saya aktif mengembangkan diri dengan mengikuti berbagai organisasi, kepanitiaan, dan perlombaan. Meskipun disibukkan dengan berbagai aktifitas tersebut, saya tetap fokus dengan pelajaran dan nilai akademik saya hingga saya berhasil mendapatkan nilai yang cukup memuaskan dan di terima di Fakultas Kedokteran dan Ilmu Kesehatan Universitas Bengkulu jalur SNMPTN. Saya ingin memperluas pengalaman dan meningkatkan skill yang saya miliki dengan mengikuti beasiswa ini yang terkenal dengan pendidikan soft skill nya.',	'Mimpi terbesar yang saya miliki adalah menjadi pendiri dari sebuah rumah sakit. Sebagai mahasiswa baru jurusan pendidikan dokter tentu saja membuat saya memiliki mimpi mimpi yang ingin saya raih kedepannya. Saya ingin sukses berkarier sebagai seorang dokter yang mampu mendirikan sebuah rumah sakit di daerah sehingga masyarakat daerah tidak perlu jauh-jauh ke kota besar hanya untuk sekedar berobat. Saya sadar bahwa untuk mencapai mimpi tersebut saya harus bekerja sangat keras dengan cara belajar bersungguh-sungguh dan selalu mengasah skill yang saya miliki sehingga saya dapat bersaing dan berakhir dengan mampu mencapai mimpi saya tersebut.',	'Saat SMP maupun SMA, saya sudah aktif mengikuti berbagai kegiatan organisasi. Yaitu pada saat kelas 7, saya sudah mengikuti organisasi OSIS sebagai anggota sekbid 5 yang merupakan sekbid kedisiplinan. \r\nSaat kelas 8, saya mencoba mencalonkan diri sebagai wakil ketua OSIS namun gagal dan dialihkan dengan jabatan wakil sekretaris. \r\nSelain itu saya juga mengikuti organisasi DKP atau Dewan Kerja Penggalang. \r\nDi tahun pertama SMA, saya juga mengikuti organisasi OSIS dengan menjabat sebagai wakil 2 Sekretaris, di tahun berikutnya saya kembali memberanikan diri untuk mencalonkan diri sebagai ketua OSIS namun berakhir dengan jabatan wakil ketua OSIS. Tak hanya itu, saya juga terpilih menjadi ketua asrama putri di sekolah saya yang kebetulan merupakan sekolah berasrama. Di tahun terakhir, saya mengikuti kepanitiaan yearbook angkatan dan menjabat sebagai sekretaris.',	1,	1655120918,	NULL,	0),
('SCHLR-DBBYM-a80a0b',	'USR-DBBYM-d3aab',	'Debby Amanda Putri ',	'2003-09-25',	'81367138285',	'Jalan Anggur 1, Blok G 32, Griya Cipta Pratama, RT 062, RW 015, 30162',	'Ekonomi Syariah / Ekonomi dan ',	'Universitas Islam Negeri Raden',	'3.53',	'2',	'Saya Debby Amanda Putri, mahasiswi tahun pertama di Universitas Islam Negeri Raden Fatah Palembang.  Saya tertarik mengikuti program ini karena saya ingin mengembangkan keterampilan saya, memperkaya pengetahuan saya dan memperluas koneksi saya. Saya ingin belajar tentang bisnis karena saya ingin mendorong pemuda Indonesia menjadi aset berharga yang dapat berkontribusi untuk negara.',	'Mimpi terbesar saya adalah menjadi manusia yang berguna bagi Agama dan Negara. Cara saya mewujudkannya yaitu dengan mengikuti program YBB dan mengajak para pemuda pemudi lain untuk mewujudkan mimpi mereka yang selaras dengan mimpi saya.',	'Belum pernah.',	1,	1654695266,	NULL,	0),
('SCHLR-DCNTP-726f9b',	'USR-DCNTP-75f71',	'DECINTA PUTRI ARIANI',	'2002-12-30',	'81239997014',	'Jl. Keputih Tegal Bhakti A.KV.21',	'Administrasi Bisnis',	'UPN Veteran Jawa Timur',	'3.78',	'2',	'saya orang yang percaya diri, penuh semangat, komitmen tinggi, komunikasi yang baik, mudah bergaul, cekatan, pantang menyerah, kerja keras. Saya juga tidak mau merepotkan orang lain, selagi saya mampu akan saya usahakan sendiri.\r\n\r\nSaya tidak suka berkeluh kesah atau bercerita kesusahan saya kepada keluarga dan orang lain, saya lebih suka mereka melihat saya setelah berhasil.',	'meringankan bebas tanggungan orang tua saya, keluarga saya bisa hidup berkecukupan serta di berikan kesehatan dan juga umur panjang, Ingin membuat keluarga saya bangga atas apa yang telah saya lakukan, membuka rumah keterampilan untuk anak anak, ibu ibu dan lansia sebagai bentuk kegiatan yang bermanfaat. cara saya untuk mewujudkannya yaitu dengan belajar bersungguh sungguh dan sukses',	'organisasi himpunan mahasiswa pada saat ini. masuk di departemen hubungan masyarakat atau humas',	1,	1655716099,	NULL,	0),
('SCHLR-DDPDL-093e9a',	'USR-DDPDL-0d902',	'Dede padli',	'2002-05-30',	'83119334569',	'Kp. Cigeulis cipanas Lebak-Banten',	'Pendidikan Kelautan dan Perika',	'Universitas Pendidikan Indones',	'3.64',	'1',	'Perkenalkan, nama saya Dede padli salah satu mahasiswa di perguruan tinggi negeri tepatnya di Universitas Pendidikan Indonesia. saya baru menginjak di semester dua pada jurusan Pendidikan Kelautan dan Perikanan. Organisasi yang saya ikuti saat ini di kampus yaitu seperti BPM ( Badan Perwakilan Mahasiswa), UKM pramuka (racana), dan UKM kerohanian Islam (LDK). Pada BPM saya menjabat di divisi pengawasan, pada UKM Kerohanian islam menjabat sebagai PDD (publikasi-dekorasi-Dokumentasi), sedangkan pada UKM pramuka saya hanya menjabat sebagai anggota. \r\nUntuk hobi sendiri saya senang sekali melukis abstrak dan sketsa wajah, senang olahraga, juga mendengarkan musik.\r\n\r\n pada saat duduk di bangku sekolah menengah pertama (SMP) saya pernah mengikuti Olimpiade Olahraga Siswa Nasional (O2SN) pada cabang basket dan mendapatkan juara ke 2. Saat duduk di bangku sekolah dasar pun saya mengikuti  Festival Lomba Seni Siswa Nasional (FLS2N) tingkat kabupaten cabang seni lukis dan mendapatkan juara ke 3. Namun dari itu semua capaian terbesar untuk saat ini bagi saya sendiri yaitu ketika saya di nyatakan lolos dalam seleksi masuk perguruan tinggi negeri jalur SNMPTN, bangga dan terharu saat itu.\r\n\r\nsalah satu kekurangan dari diri saya yaitu pelupa. Ya, tidak tahu kenapa saya sering sekali lupa, hal itu membuat saya kesal. Namun biasanya saya mengatasi hal tersebut dengan mencatat semua dalam sebuah kertas kecil lalu saya tempel tepat di depan pintu kamar, supaya nantinya saya ingat dengan apa yg ingin saya lakukan/ kerjakan atau yang lainnya.',	'Dari dulu sampai sekarang mimipi terbesar saya masih sama yaitu ingin menjadi seorang tenaga pendidik(guru), ingin berkontribusi dalam memajukan dunia pendidikan di indonesia. selain itu saya juga ingin membangun sebuah pemberdayaan masyarakat terhadap alam khususnya laut yang ada di daerah saya yaitu daerah Banten. memberikan pemahaman kepada masyarakat sekitar pesisir. \r\nhal itu bisa saya wujudkan tentunya dengan usaha dan kerja keras saya dalam belajar dan mencari pengalaman serta relasi di dunia luar. saya yakin dengan saya selalu fokus dan konsiste terhadap apa yang saya tekuni,semua impian saya pasti bisa terwujud. Aamiin ',	'Untuk Pengalaman yang dari dalam itu sendiri seperti yang saya sudah jelaskan di pertanyaan sebelumnya yaitu ada organisasi pramuka juga kerohanian selain itu ada juga organisasi unit kemahasiswaan.\r\n\r\nuntuk yang dari luar saya organisasi yang pernah saya ikuti yaitu IPNU/IPPNU. IPNU/IPPNU berasal dari singkatan Ikatan pelajar nahdatul ulama/ikatan pelajar putri nahdatul ulama. Organisasi ini merupakan organisasi yang bersifat keterpelajaran, kekaderan, kemasyarakatan, kebangsaan dan keagamaan yang berhaluan Islam Ahlussunah Waljamaah.\r\nUntuk bisa berada di organisasi ini ada yang namanya pengkaderan yang dimaksudkan untuk mencetak kader-kader yang akan melanjutkan perjuangan organisasi. ada 6 tahap pengkaderan yang harus di lewati diantaranya yaitu Masa Kesetiaan Anggota (Makesta),Latihan Kader Muda (Lakmud),Latihan Kader Madya (Lakmad),Latihan Kader Utama (Lakut), Pelatihan Pelatih (bersifat khusus), dan Latihan Pengembangan Minat dan Bakat (bersifat khusus).\r\nDi organisasi ini saya menjabat sebagai anggota selama satu setengah tahun.',	1,	1654097085,	NULL,	0),
('SCHLR-DDPDL-ee7fe0',	'USR-DDPDL-0d902',	'Dede padli',	'2002-05-30',	'83119334569',	'Kp. Cigeulis, Cipanas Lebak-Banten',	'Pendidikan Kelautan dan Perika',	'Universitas Pendidikan Indones',	'3.64',	'1',	'perkenalkan saya Dede Padli, salah satu mahasiswa di perguruan tinggi negeri yaitu tepatnya di Universitas pendidikan Indonesia Jurusan Pendidikan Kelautan dan Perikanan sudah menginjak semester dua. \r\nDi kampus saya mengikuti beberapa Organisasi diantaranya BPM (Badan Perwakilan Mahasiswa) dan UKM (Unit Kegiatan Mahasiswa) yaitu UKM Kepramukaan (racan) dan UKM Kerohanian Islam (LDK). Pada BPM saya menjabat sepagai Divisi Pengawasan, pada UKM kerohanian islam saya menjabat sebagai Divisi PDD (publikasi-Dekorasi-Dokumentasi), sedangkan pada UKM kepramukaan saya menjabat sebgai anggota saja.\r\n\r\nUntuk hobi saya suka sekali melukis sketsa wajah juga abstrak, saya suka olahraga serta mendengarkan musik.\r\npada saat saya duduk di bangku sekolah dasar saya pernah mengikuti Festival Lomba Seni Siswa Nasional (FLS2N) pada cabang melukis dan mendapatkan juara ke 3, sedangkan pada saat duduk dibangku sekolah menengah pertama (SMP) saya pernah mengikuti Olimpiade Olahraga Siswa Nasional (O2SN) cabang bola basket dan mendapatkan juara 2. Namun dari keduanya hal paling yang membanggakan bagi saya sendiri yaitu ketika saya dinyatakan lolos dalam seleksi Perguruan tinggi negeri jalur SNMPTN, bangga dan terharu tentunya.\r\n\r\nsalah satu kekurangan yang saya miliki yaitu pelupa. ya, saya suka sekali lupa akan sesuatu. tapi, biasanya saya mengatasi hal tersebut dengan cara menulis sebuah catatan kecil di kertas, mencatat hal-hal yang saya akan lakukan atau apapun itu lalu saya tempel di depan pintu kamar yang supaya nantinya dapat saya liat dan tidak lupa.\r\n',	'Dari dulu sampai sekarang impian terbesar saya yaitu ingin menjadi seorang tenaga pendidik, ingin sekali berkontribusi pada dunia pendidikan di indonesia, sera saya ingin mendirikan pemberdayaan masyarakat pesisir pantai terhadap kekayaan yang ada di sekitarnya. memberi pemahaman secara jelas dan nyata. Dengan bekal ilmu dari kampus serta pengalaman yang saya punya, saya terapkan di lapangan nantinya.\r\n\r\nImpian itu bisa saya terwujudkan tentunya dengan belajar dengan giat dan terus berjuang, tidak lupa memperbanyak relasi dan juga pengalaman. tetap fokus dan tekun atas apa yang sudah menjadi tujuan yang pasti dan sangat pasti jika itu semua terlaksana dengan baik impian akan bisa terwujud. Aamiin ya robbal alamin',	'punya.\r\nsaya mengikuti organisasi keislaman yaitu IPNU/IPPNU pada tahun 2018-2019 sebagai anggota. IPNU/IPPNU singkatan dari Ikatan Pelajar Nahdatul ulama/Ikatan Pelajar Putri Nahdatul Ulama.\r\nOrganisasi ini merupakan organisasi di bawah naungan Jamiyyah Nahdlatul Ulama yang bersifat keterpelajaran, kekaderan, kemasyarakatan, kebangsaan dan keagamaan yang berhaluan Islam Ahlussunah Waljamaah. \r\nUntuk kegiatan didalamnya banyak sekali namun untuk bisa masuk kedalam organisasi tersubut diperlukan pengkaderan  terlebih dahulu yang dimaksudkan untuk mencetak kader-kader yang akan melanjutkan perjuangan organisasi. ada beberapa tahap dalam pengkaderan tersebut diantaranya yang perama ada Masa Kesetiaan Anggota (Makesta), Latihan Kader Muda (Lakmud), Latihan Kader Madya (Lakmad), Latihan Kader Utama (Lakut), serta dua tahap yg sifatnya tidak wajib bagi semuanya yaitu Pelatihan Pelatih dan Latihan Pengembangan Minat dan Bakat.\r\nLatihan Pengembangan Minat dan Bakat',	1,	1654103129,	NULL,	0),
('SCHLR-DHNDR-6ab6d7',	'USR-DHNDR-9ac54',	'Dheandra Maharani',	'2006-02-04',	'89516672566',	'Gg. Mandor lipin rt01 rw04 Cilangkap, Tapos, Depok, Jawa Barat',	'Perkantoran',	'SMK Perintis Depok',	'8.0',	'1',	'Perkenalkan nama saya Dheandra Maharani umur saya 16th. Saya anak ke 3 dari 5 bersaudara. Ayah saya seorang tukang bangunan dan ibu saya adalah ibu rumah tangga. Saya pernah bersekolah di MI Tarbiyatul Falah, SMPN 12 Depok, dan bersekolah di SMK Perintis Depok. Hobi saya berpetualang dan bermusik, saya senang dan aktif dalam berorganisasi',	'Mimpi terbesar saya adalah merubah kehidupan keluarga saya dan bisa mensekolahkan adik² saya. Cita cita saya ingin menjadi pengusaha, cara saya mewujudkan nya yang pertama selalu menanamkan mimpi dan niat saya untuk dapat tercipta, tidak pernah melihat kekurangan saya untuk dapat membatasi impian saya, terus berusaha semampu saya. Dan saya aktif mengikuti olimpiade2 untuk membantu menambah dan memudahkan pendidikan saya, serta menambah ilmu untuk kedepan nya.',	'Iya pernah. Saya pernah menjadi anggota organisasi intra sekolah atau osis, saya sangat senang berorganisasi, dengan organisasi saya mendapat banyak ilmu dan ilmu sosial, dan saya mendapat banyak pengalaman yang belum pernah saya dapat, saya sangat senang berorganisasi dan bersosialisasi, dan saya selalu aktif menjadi pelopor kegiatan diteman2 saya hehe',	1,	1653564419,	NULL,	0),
('SCHLR-DHNDR-e2d811',	'USR-DHNDR-9ac54',	'Dheandra Maharani',	'2006-02-04',	'89516672566',	'Gg. Mandor lipin rt 01 rw 04 Cilangkap, Tapos, Depok, Jawa Barat',	'Perkantoran',	'Smk Perintis Depok',	'8.0',	'1',	'Perkenalkan nama saya Dheandra Maharani umur saya 16 thn, saya anak ke 3 dari 5 bersaudara. Ibu saya adalah ibu rumah tangga, ayah saya seorang tukang bangunan, keluarga saya bisa dibilang keluarga tidak mampu, saya pernah bersekolah di Mi Tarbiyatul Falah, SMPN 12 Depok, sekolah di Snk Perintis Depok, saya hobi berpetualang saya hobi bermusik',	'Mimpi terbesar saya adalah merubah kehidupan keluarga saya, saya ingin mensekolahkan adik² saya dan saya ingin membanggakan orang tua saya. Cita2 saya ingin menjadi pengusaha. Cara saya mewujudkan impian saya adalah selalu menanamkan niat dan mimpi saya menjadi moto hidup, terus belajar dan berusaha, saya aktif dalam mengikuti olimpiade² agar bisa mempermudah sekolah saya selanjutnya, saya tidak pernah melihat kekurangan saya untuk mendapatkan mimpi saya, tapi yang saya lihat adalah cara untuk mendapatkan jalan kedepannya, yaitu aktif mengikuti banyak kegiatan olimpiade, dan beasiswa scholarship ini adalah salah satu jalan saya untuk terus berjalan',	'Pernah. saya pernah menjadi anggota organisasi intra sekolah atau osis di smp. saya selalu senang berorganisasi karna mendapatkan banyak ilmu sosialisasi dan lain nya, saya juga mendapat banyak pengalaman yang belum pernah saya temukan, dalam organisasi saya selalu menjadi pelopor yang aktif',	1,	1653551077,	NULL,	0),
('SCHLR-DHNLL-b0e6ac',	'USR-DHNLL-04c08',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655689960,	NULL,	0),
('SCHLR-DHNLL-b86bcd',	'USR-DHNLL-04c08',	'Dheani Laily',	'2003-06-29',	'82164907886',	'Jl. Bacang No 20 A, Kec. Kisaran Timur, Kab. Asahan, Sumatera Utara.',	'Prodi Kimia Fakultas Sains dan',	'Universitas Diponegoro',	'4.00',	'2',	'Nama saya Dheani Laily mahasiswi semester 2 Program Studi Kimia Universitas Diponegoro. Saya merupakan orang yang berambisi tinggi pada suatu hal yang ingin saya capai, dapat dibuktikan dari perjuangan saya untuk lolos seleksi Universitas Diponegoro yang ketat, walau sudah pernah gagal sebelumnya pada saat SNMPTN saya tetap berusaha untuk mencari cara lain seperti mengikuti penerimaan mahasiswa jalur prestasi di Universitas Diponegoro dan Alhamdulillah saya lolos. Prestasi yang dapat mengantar saya ke depan pintu Universitas diponegoro merupakan hasil dari usaha serta waktu yang saya korbankan. Saya memiliki motto hidup bahwa apabila saya memiliki ambisi maka saya harus punya potensi. Oleh karna itu, saya dikenal sebagai orang yang teguh dan bekerja keras. \r\nSaya memiliki minat pada bidang riset dan aktif mengikuti perlombaan dan kegiatan yang diselenggarakan baik Nasional maupun Internasional. Pada saat mengikuti kegiatan atau perlombaan, selain mendapat pengalaman saya juga dapat menambah teman baru dari berbagai daerah. Saya juga sangat menyukai hal-hal baru dan senang untuk mencari tahu lebih pada hal yang ingin saya ketahui.\r\n',	'Mimpi terbesar saya yaitu untuk melanjutkan pendidikan setinggi-tingginya agar dapat menerapkannya menjadi hal yang berguna bagi masyarakat luas, dimulai dari penelitian saya yang kecil hingga penelitian skala besar yang dapat membantu memecahkan suatu permasalahan pada masyarakat. Cara saya mewujudkan mimpi saya tersebut tentu saja dengan belajar giat dan bersungguh-sungguh serta tak lupa saya juga harus peka terhadap sekitar dan mengeksplorasi suatu hal atau permasalahan secara seksama sehingga saya mengetahui apa yang dapat saya lakukan atau dari ilmu yang saya pelajari bagaimana cara saya mengatasinya. ',	'Organisasi yang sedang saya ikuti saat ini yaitu Himpunan Mahasiswa Kimia, lebih tepatnya saya mengikuti 2 bidang pada HMK yaitu bidang akademik dan bidang rohani. Pada bidang akademik atau disebut Valensi, saya berperan sebagai anggota yang bertugas untuk membantu program kerja selama periode tersebut dengan mengikuti semua kepanitian acara. Pada bidang rohani atau disebut Ksikamu saya berperan sebagai wakil ketua divisi syiar yang bertugas untuk membantu kerja dari ketua serta ikut mengawasi keberlangsungan program kerja pada divisi. Pada saat mengikuti organisasi banyak sekali pengalaman yang saya dapatkan dimulai dari cara mengkoordinasikan tugas pada semua anggota, mengasah problem solving pada diri saya, public speaking dan cara membuat suatu organisasi tersebut berjalan lancar dengan semua program kerja yang direncanakan.',	1,	1655691212,	NULL,	0),
('SCHLR-DHPTR-140da8',	'USR-DHPTR-48552',	'Adha Putri Ananda',	'2005-01-19',	'83181982538',	'Sungai Nipah Painan Selatan Painan',	'Teknik Lingkungan',	'Universitas Andalas',	'3.98',	'1',	'Kemampuan yang saya miliki diantaranya :\r\n\r\nPercaya sepenuhnya dengan diri sendiri\r\nMampu mengambil keputusan\r\nPandai meyakinkan tanpa menyakiti\r\nSangat fokus mencapai tujuan\r\nTerbiasa memetakan masalah demi penyelesaian yang terbaik\r\nSaya adalah seseorang yang tidak mudah menyerah\r\nSaat duduk di bangku SMA dan bergabung dalam organisasi saya selalu dibutuhkan saat berdiskusi\r\nSaya mampu menjadi pemimpin yang baik dan amanah\r\nSaya memiliki Prestasi Akademik Yang Baik\r\nSaya memiliki Prestasi Non Akademik\r\nSaya Aktif Berorganisasi\r\nSaya memiliki tujuan yang jelas tentang rencana yang akan saya lakukan jika mendapat beasiswa ini dan bertekad menyelesaikan proses pendidikan dengan tepat waktu\r\nMemiliki Jiwa Sosial Tinggi \r\nSaya dapat melengkapi Seluruh Persyaratan beasiswa tepat Waktu\r\nMemiliki Track Record (Rekam Jejak) Yang Baik\r\nKeyakinan Dalam Diri yang kuat\r\n',	'Mimpi terbesar saya untuk Indonesia di Masa Mendatang\r\n\r\nSumber Daya Manusia Indonesia yang kecerdasan nya mengungguli bangsa bangsa lain di dunia\r\nMasyarakat Indonesia yang menjunjung tinggi pluralisme, berbudaya, religius dan nilai nilai etika\r\nIndonesia menjadi pusat pendidikan , teknologi, dan peradaban dunia\r\nMasyarakat dan aparatur pemerintah yang bebas dari perilaku korupsi\r\nIndonesia menjadi negara yang mandiri dan berpengaruh besar di Asia Pasifik\r\nIndonesia menjadi Barometer pertumbuhan ekonomi dunia\r\n\r\nCara saya untuk mewujudkan nya diantaranya :\r\nMeningkatkan literasi\r\nTerbuka dalam menerima berbagai pemikiran dan pengalaman baru\r\nBerkontribusi memajukan Indonesia dengan menjadi relawan di berbagai kegiatan\r\nMendukung produk lokal Indonesia dan mencintai produk dalam negeri\r\nMenjadi pengguna Internet dan media sosial yang baik\r\n',	'Pengalaman Organisasi\r\n\r\nNama organisasi : Komisi Pemilihan Umum Sekolah (KPUS) SMA NEGERI 3 PAINAN\r\n\r\nJabatan : Anggota Divisi IV Data Umum dan Informasi\r\n\r\nMasa jabatan : 2020/2021\r\n\r\nTanggung Jawab : Menjadi anggota divisi 4 KPUS , saya bertanggung jawab atas data kepengurusan dan kepanitiaan pada saat pemilihan umum di sekolah. Selain itu, saya dan tim divisi 4 juga bertanggung jawab atas informasi dan statistik data siswa/i di sekolah serta beberapa program kerja reguler lainnya.\r\n\r\nPengalaman Sebagai Relawan ( Volunteer )\r\n\r\nNama kegiatan : Dies Natalis SMA NEGERI 3 PAINAN\r\n\r\nJabatan/Peran  : Seksi Bidang Performance\r\n\r\nTahun : 2021\r\n\r\nTanggung Jawab : Menjadi anggota Seksi Bidang Performance, saya bertanggung jawab atas kelancaran performance yang dilaksanakan pada saat Acara Dies Natalis dimulai, hingga malam puncak Dies Natalis. Seminggu sebelum pelaksanaan dies natalis, saya dan tim melakukan aksi relawan dengan turun ke lapangan untuk menanam 1000 pohon kebaikan di sepanjang pantai Sago tempat kami melakukan bakti Dies.',	1,	1654254497,	NULL,	0),
('SCHLR-DHRVN-ced7c4',	'USR-DHRVN-297af',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654323803,	NULL,	0),
('SCHLR-DHTYL-968081',	'USR-DHTYL-37902',	'Adhitya Alfath Alfadholi',	'2000-01-15',	'81327428285',	'Pos Wetan RT 26/RW 04, Mliwis, Cepogo, Boyolali',	'Pengelolaan Hutan',	'Universitas Gadjah Mada',	'3.38',	'2',	'Saya adalah seorang yang pantang menyerah. Saya sudah berulang kali mendaftar beasiswa-beasiswa yang sering dishare di Instagram tapi belum pernah lolos. Saya juga merupakan orang yang bertanggungjawab dalam sebuah amanah. Apabila dikasih amanah saya akan mengerjakkan amanah tersebut dengan sungguh-sungguh. ',	'Financial Freedom di Usia 25. Cara menggapainya adalah belajar dan terus belajar serta investasi mulai dari sekarang',	'Pernah. yaitu di Rumah Zakat Infaq Shodaqoh UGM dan Jama\'ah Shalahuddin UGM. Pada Rumah Zakat Infaq Shodaqoh UGM saya berperan sebagai penyalur dan pengelola zakat untuk disalurkan kepada orang yang membutuhkan zakat di Daerah Istimewa  Yogyakarta. Pada organisasi Jama\'ah Shalahuddin UGM saya berperan di bidang Administrasi dan Perpustakaan Jama\'ah Shalahuddin UGM. Selain itu saya juga pernah menjalani parttime di Koperasi Kopma UGM',	1,	1655735801,	NULL,	0),
('SCHLR-DKRRM-de11d1',	'USR-DKRRM-815b4',	'Dikri Romadon ',	'2002-10-08',	'82120195466',	'Kp. Sarinieun Des. Lengkongjaya Kec. Cigalontang Kab. Tasikmalaya provinsi Jawa Barat ',	'Manajemen Dakwah ',	'UIN Sunan Kalijaga Yogyakarta ',	'3.83',	'2',	'Perkenalkan saya Dikri Romadon tinggal di Tasikmalaya, lahir pada tanggal 08 Oktober 2002. saya sekarang sedang melanjutkan pendidikan di universitas Islam di Yogyakarta tepatnya di UIN Sunan Kalijaga Yogyakarta dengan jurusan Manajemen Dakwah dengan nilai akademik yang baik dimana saya memiliki cita-cita ingin mengembangkan sumber daya manusia yang berbasis Islami karena di Manajemen Dakwah sendiri memiliki 3 konsentrasi yaitu Manajemen Sumber Daya Manusia, Manajemen Keuangan syariah dan Manajemen Haji dan Umrah. Oleh karena itu kedepannya saya bisa mengambil konsentrasi Manajemen SDM yang berbasis keislaman.\r\nSaya adalah anak ke 2 dari 2 bersaudara dimana kondisi ekonomi cukup berat untuk keluar meskipun anak yang pertama sudah berkeluarga tetapi ada tanggung hutang oleh karena itu untuk meringankan orang tua saya berharap dapat memperoleh beasiswa ini.\r\nHarapan jika terpilih dalam beasiswa ini saya dapat meringankan orang tua dalam hal biaya kuliah dan menjadi kebangaan orang tua dimana anak pertama yang dapat gelar sarjana di keluarga saya. \r\nSelain masalah keuangan menjadi dorongan kuat untuk mendapatkan beasiswa, akan tetapi saya memiliki minat bakat yang saya yakini mampu untuk kuliah dengan baik serta dapat lulus menjadi sarjana yang memiliki spesifik keahlian dalam bidang Manajemen SDM yang berbasis keislaman.\r\n',	'1. Membahagiakan dan membanggakan kedua orang tua\r\n2. Bisa membawa pengaruh besar untuk masyarakat sekitar\r\nYang pertama untuk mewujudkan nya saya bisa masuk ke perguruan tinggi itu sudah membuat orang tua saya bahagia dan bangga karena memang latar belakang pendidikan orang tua saya hanya sampai SD jadi ketika saya satu-satunya di keluarga yang masuk ke PTN membuat orang tua saya antusias meskipun memang agak berat dalam masalah biaya makanya saya berharap dengan bisa mendapatkan beasiswa ini untuk meringankan beban orang tua saya dan saya juga berusaha supaya bisa dapat tambahan uang kuliah sendiri.\r\nKedua cara saya mewujudkan nya saya bisa kuliah di prodi yang sesuai dengan minat saya yang mungkin kebanyakan orang prodi saya hanya mengurus dakwah tapi di sini saya ingin mendalami manajemen nya terkhusus di bidang SDM yang pasti berbasis ke Islam nah saya berharap ketika saya sudah lulus saya bisa membawa perubahan untuk masyarakat sekitar dengan memanfaatkan anak muda di sana untuk menjalin hubungan kerjasama.',	'Organisasi saya LDK ( Lembaga Dakwah Kampus) yang bergerak dalam kegiatan dakwah baik secara langsung maupun tidak langsung terkhusus dalam kegiatan kesosialan menyantuni kaum duafa.\r\nUntuk relawan saya pernah menjadi relawan di komunitas pelajar peduli ( KPP) dalam kegiatan menyantuni anak yatim piatu yang di selenggarakan setiap hari Jum\'at.\r\nSelanjutnya menjadi relawan peduli korban banjir Pasaman yang mana kami berkolaborasi antara LDK, KPP dan KAMMI untuk turun kelapangan meminta donasi ke setiap pengendara jalan di lampu merah dan Alhamdulillah terkumpul 2juta lebih yang langsung di salurkan kepada korban banjir di Pasaman.',	1,	1653892171,	NULL,	0),
('SCHLR-DLKT-ec4930',	'USR-DLKT-bc4a1b',	'Edi Lukito',	'2002-07-23',	'85696688155',	'Desa Kaleke, Kab. Sigi, Sulawesi Tengah',	'Ilmu Hadist - Ushuluddin',	'Universitas Al-Azhar',	'3.59',	'1',	'Setiap orang mengenal saya sebagai sosok yang rajin, jujur,  disiplin, dan sedikit ambis apabila menginginkan sesuatu, tentunya saya orang yang tidak suka menunda pekerjaan. Alhamdulillah selama sekolah saya selalu rangking satu, dan juga berprestasi diluar kelas seperti mengikuti lomba- lomba dan organisasi. Sekarang saya tertarik dengan menulis, fotografi, dan jurnalistik, dan saya ingin mengembangkan skill public speaking. Saya alumni dari pondok pesantren, setelah tamat saya diterima di 2 kampus Negeri di Indonesia, yaitu UB dan UIN Jakarta. Saya memilih UB, tetapi ditahun berikutnya saya diterima di Universitas Al-Azhar Kairo, akhirnya saya sekarang sedang menempuh pendidikan disini. ',	'Mimpi terbesarku adalah menjadi pemimpin daerah agar bisa lebih leluasa membantu orang-orang . Saya mewujudkannya dengan membangun banyak relasi, berbuat baik sebanyak-banyaknya, belajar ilmu kepemimpinan dan pemerintahan, berkontribusi dari sekarang dalam kemajuan daerah dan negara. Mimpi terbesarku untuk waktu dekat ini adalah membangun sekolah yang didaerah ku, berkontribusi untuk kecerdasan masyarakat. ',	'Saya mempunyai pengalaman organisasi di lembaga pers mahasiswa di UB, aktiv sebagai pengurus Risma didaerah ku, sewaktu SMA aktif di osis bidang Humas, dan pimpinan sangga Pramuka. Saya sebelum berangkat ke Mesir mengajar disekolah didaerah saya sendiri, yang mana mmg sekolah itu tidak ada tenaga pengajar nya. Setelah saya berangkat  ke Mesir pun sekolah disana tutup, karna tdk ada pengajar, dari kejauhan saya terus mencari-cari pengajar yg bersedia mengajar disana sampai saya kembali. ',	1,	1655451448,	NULL,	0),
('SCHLR-DLLY-20a763',	'USR-DLLY-4e68a0',	'Dilla Ayu Rifianti',	'2005-06-11',	'85721433630',	'Jl Raflesia 4 No 25 Kecamatan Rancaekek Kelurahan Rancaekek Kencana Kabupaten Bandung ',	'Akuntansi keuangan dan lembaga',	'SMKN 1 Bandung ',	'3.7',	'4',	'Perkenalkan nama saya Dilla Ayu Rifianti biasa dipanggil Dilla, saya sekarang berumur 17 tahun tinggal di Kabupaten Bandung tepatnya di Rancaekek.  Saya lahir pada tanggal 11 Juni 2005 di Rancaekek tempat saya tinggal sekarang. Saya sekolah di salah satu SMK terbaik di Jawa Barat yaitu di SMKN 1 Bandung di Jurusan Akuntansi Keuangan Lembaga dan semester ini saya kelas 11 dan sedang praktek kerja lapangan. Di sekolah nilai akademik saya memiliki peringkat yang cukup baik dan saya juga suka aktif di dalam kelas pada saat jam pelajaran.  Saat ada waktu luang saya suka belajar mata pelajaran di sekolah yang saya suka seperti bahasa Inggris dan Akuntansi Perdagangan, selain itu saya juga suka  mempelajari Microsoft office seperti word dan Excel dan aplikasi untuk mencatat akuntansi seperti myob/abss, saya suka belajar rumus rumus Excel yang baru dan menerapkan nya karena saya memprediksi bahwa untuk masa depan pasti teknologi lebih canggih lagi dan saya perlu untuk mempelajari itu semua.\r\nKelebihan saya adalah bisa bekerja dengan cepat dan tepat, saya juga bisa konsisten dan giat saat sedang mempelajari sesuatu yang baru baik dalam mata pelajaran atau di luar mata pelajaran sekolah dan saya bisa mengerjakan sesuatu tepat waktu, saya juga memiliki etika yang baik dalam bertutur kata maupun sikap \r\nKelemahan saya adalah dalam mata pelajaran tidak bisa sekali penjelasan langsung mengerti dan paham apa yang dipelajari (sesuai kelebihan saya yaitu suka belajar konsisten dan giat saat mempelajari sesuatu yang baru), saya juga kurang bisa berkomunikasi dengan baik contohnya yaitu saya saat sedang berkomunikasi dengan orang saya suka terlalu cepat berbicara dan kadang kurang dimengerti. Sekarang saya sedang berusaha untuk memperbaiki cara berkomunikasi yang baik dan benar',	'Mimpi terbesar saya adalah ingin melanjutkan kuliah di luar negeri di salah satu universitas ternama yang sangat bagus yaitu di University of Harvard dan bisa membanggakan nama Indonesia dari segi manapun yang baik agar bangsa Indonesia bisa lebih dihargai dan dikenal di kancah internasional, saya juga ingin menjadikan anak anak Indonesia sebagai anak yang berpendidikan dari segi etika dan moral yang baik serta kualitas akademik yang bagus agar bisa bersaing secara internasional dan menjadikan Indonesia menjadi negara yang maju. Cara saya mewujudkan mimpi tersebut adalah yang paling penting yaitu harus belajar dengan giat, rajin, berkonsentrasi yang baik, mampu berpikir kritis, tetap konsisten setiap hari serta berdoa kepada tuhan yang maha esa agar cita cita saya tercapai dengan baik.',	'Saya pernah menjadi seksi acara dalam organisasi ikatan remaja masjid untuk peringatan hari maulid nabi Muhammad, dan saya pernah menjadi Sekretaris dalam acara masjid selama sebulan penuh selama bulan Ramadhan. Pengalaman saya selama organisasi memang masih sedikit tapi saya akan terus menambah pengalaman organisasi saya agar saya bisa mengembangkan potensi dan kemampuan saya agar bisa bersosialisasi lebih baik lagi.',	1,	1655730679,	NULL,	0),
