('SCHLR-DLMSR-836faf',	'USR-DLMSR-feb61',	'DELIMA ASRI MUSFIRA',	'2003-05-04',	'85947540405',	'Jl. Mutiara 12 Blok A No.54 RT003/RW013 Komp. Bulak Macan Permai\r\nKel. Harapan Jaya Kec. Bekasi Utara \r\nKota Bekasi 17124',	'Program Studi Ilmu Komunikasi ',	'Universitas Muhammadiyah Prof.',	'3.90',	'1',	'Saya lulusan SMK tahun 2021, saat ini saya sedang berkuliah semester 2 di UHAMKA Jakarta dengan program studi ilmu komunikasi, saya merupakan orang yang tepat waktu, teliti dan tekun.',	'Mimpi saya adalah menjadi orang yang sukses, dan saat ini saya mempunyai rencana agar menuju sukses itu dengan cara berkuliah dengan IPK > 3.8 ',	'Iya, saat ini saya sedang mengikuti organisasi Pansus DPM dan HIMAKOM\r\nDari ke2 organisasi ini saya mendapat banyak pengalaman baru, dan saya juga bisa meningkatkan ketepatan waktu saya terhadap tanggung jawab yang diberikan kepada saya.',	1,	1654148834,	NULL,	0),
('SCHLR-DLMSR-edf860',	'USR-DLMSR-feb61',	'DELIMA ASRI MUSFIRA',	'2003-05-04',	'85947540405',	'Jl. Mutiara 12 Blok A No.54 RT003/RW013 Komp. Bulak Macan Permai\r\nKel. Harapan Jaya Kec. Bekasi Utara \r\nKota Bekasi 17124',	'Program Studi Ilmu Komunikasi ',	'Universitas Muhammadiyah Prof.',	'3.90',	'1',	'Saya lulusan SMK tahun 2021, saat ini saya sedang berkuliah semester 2 di UHAMKA Jakarta dengan program studi ilmu komunikasi, saya merupakan orang yang tepat waktu, teliti dan tekun.',	'Mimpi saya adalah menjadi orang yang sukses, dan saat ini saya mempunyai rencana agar menuju sukses itu dengan cara berkuliah dengan IPK > 3.8 ',	'Iya, saat ini saya sedang mengikuti organisasi Pansus DPM dan HIMAKOM\r\nDari ke2 organisasi ini saya mendapat banyak pengalaman baru, dan saya juga bisa meningkatkan ketepatan waktu saya terhadap tanggung jawab yang diberikan kepada saya.',	1,	1654148732,	NULL,	0),
('SCHLR-DLNZW-524ca7',	'USR-DLNZW-5e2c8',	'Delia Nazwa Hasibuan',	'2004-10-14',	'81269751226',	'Jalan sidodame no 52',	'Farmasi',	'SMAS AL ULUM MEDAN',	'3.98',	'1',	'Saya adalah seseorang yang sederhana yang memiliki tekad yang kuat untuk maju. Memiliki niat yang kuat untuk membahagiakan kedua orang tua saya dan membalaskan jasa mereka. Memiliki kemampuan yang cukup baik di dalam bidang akademik.',	'Mimpi terbesar saya adalah saya bisa menjadi seorang penemu obat suatu penyakit yang dapat bermanfaat di dunia kesehatan kelak. Cara saya di masa menjelang kuliah sekarang ini adalah dengan terus giat belajar mengenai bidang farmasi.',	'Iya, organisasi tahfiz dimana didalam organisasi tersebut kami mempunyai tujuan untuk menuntaskan hafalan sampai yang ditentukan',	1,	1654764335,	NULL,	0),
('SCHLR-DLTHF-f20906',	'USR-DLTHF-02e62',	'Dea Luthfianti Maharani',	'2002-12-21',	'85258686810',	'Jl. Awikoen Tama Tengah No.17 RT 3 RW 2 Kel. Gending Kec. Kebomas Kab. Gresik 61121',	'Kimia',	'Universitas Brawijaya',	'3.45',	'2',	'Cerita tentang diri :\r\n1.	Saya orang yang berdedikasi penuh atas pekerjaan saya. \r\nSaya adalah pribadi yang visioner dan berkemauan keras untuk mencapai target. Sekali saya melangkah dan memutuskan untuk terlibat dalam suatu organisasi atau project, saya akan menyelesaikan pekerjaan tersebut semaksimal mungkin. Saya mampu memanajemen waktu dengan baik, sehingga walaupun banyak deadline, pekerjaan tetap dapat terselesaikan dengan baik.\r\n2.	Senang menyenangi perubahan dan cepat mengevaluasi kesalahan.\r\nSaya mampu melakukan perencanaan dan memiliki beberapa plan sekaligus. Saya mampu melihat suatu situasi dan kondisi tertentu dalam berbagai perspektif, sehingga memudahkan saya untuk mencari titik tengah dari masalah tersebut secara efisien. \r\n3.	Leadership dan teamwork yang baik\r\nSemasa SMA, Saya diamanahi menjadi Sekretaris suatu project adalah Donor Darah dimana project ini melibatkan pihak organisasi yang saya ikuti yaitu PMR, pihak sekolah dan pihak PMI Kabupaten di daerah saya. Selama project berlangsung, saya bekerja dengan baik untuk bisa membaur serta bekerja berdampingan dengan panitia lain untuk mencapai tujuan project.',	'Mimpi terbesar Saya adalah bekerja di salah satu perusahaan milik negara sehingga nantinya Saya turut berkontribusi terhadap perekonomian negara. Di sisi lain, saya ingin membangun usaha yang memiliki pegawai ibu rumah tangga guna mengisi waktu luang di sela kesibukan mengurus rumah tangga. Cara Saya untuk mewujudkannya adalah dengan mengikuti sekolah formal serta mengikuti berbagai webinar dan workshop terkait. Saya selalu berusaha untuk mengasah softskill dan hardskill yang Saya miliki. Saya merupakan pribadi yang suka belajar agar terus menjadi pribadi yang tumbuh dan berkembang.',	'Pengalaman Organisasi\r\n1.	Anggota Tim Adiwiyata SD Semen Gresik tahun 2009-2015\r\n2.	Bendahara Pramuka Putri SMP Negeri 1 Gresik tahun 2016-2018\r\n3.	Sekretaris Palang Merah Remaja SMA Negeri 1 Gresik tahun 2019-2021\r\n4.	Anggota PIK Remaja SMA Negeri 1 Gresik tahun 2019-2020\r\n5.	Anggota Palang Merah Indonesia Kab. Gresik tahun 2018-2021\r\n6.	Staf Divisi Humas LPM basic FMIPA UB\r\n7.	Staf Networking RITMA FMIPA UB\r\n\r\nPengalaman Voluuntering\r\n1.	Ikut menjadi bagian dari pelaksanaan donor darah SMA Negeri 1 Gresik tahun 2018 dan 2019\r\n2.	Mengadakan bakti sosial saat beberapa wilayah di Gresik tertimpa musibah banjir\r\n3.	#BerbagiPeran by pemimpin.id dimana merupakan kampanye agar pemimpin muda membawa peran baik kepada masyarakat\r\n4.	World Cancer Day by PunyaLink dimana bertujuan untuk meningkatkan kesadaran terhadap masyarakat tentang kanker dan menyebarluaskan informasinya ke masyarakat.',	1,	1655355734,	NULL,	0),
('SCHLR-DLVYN-238621',	'USR-DLVYN-f81a9',	'Delvyani Angelina Renata Selan',	'2002-05-14',	'81234047692',	'Jalan A. Kaesmetan, Kel. Nunumeu, Kab. TTS, Kota SOE, NTT',	'Psikologi',	'Universitas Nusa Cendana',	'3.53',	'4',	'Hallo, perkenalkan nama saya Delvyani Angelina Renata Selan. Biasanya saya dipanggil Delvy. Saya adalah mahasiswi semester IV di Universitas Nusa Cendana, Fakultas Kesehatan Masyarakat, Program Studi Psikologi di Nusa Tenggara Timur (NTT). Saya adalah seorang remaja berusia 20 tahun yang sedang berkutat dengan quarter life crisis. saya adalah anak sulung dari 5 bersaudara yang menjadi saksi jatuh bangun keluarga saya sendiri. yang selalu dituntut untuk memberikan teladan yang baik pada adik - adik, tak terasa ada ekspetasi orang tua yang ditaruh di pundak saya. Saya adalah seorang remaja yang hidup dengan didikan yang keras layaknya orang NTT pada umumnya. Disiplin dan  bekerja keras adalah sesuatu yang terus ditanamkan dalam pendidikan. Meraih pendidikan yang setinggi - tingginya adalah harapan dari orang tua. walaupun saya sadar akan ada banyak hal yang harus diikhlaskan karena harus berbagi waktu dan finansial dengan adik - adik yang juga sedang menempuh pendidikan baik yang SMA, SMP, SD, dan TK. Tetapi hal ini tidak pernah membuat saya putus harapan akan masa depan saya. Dari kecil saya sudah belajar untuk menjual camilan buatan mama untuk dapat pemasukan sedikit demi sedikit sebagai uang buku, fotokopi,  dll. saya adalah seorang remaja yang sangat senang untuk memecahkan masalah mengenai isu – isu sosial dalam kehidupan sehari. Saya percaya bahwa belajar isu sosial disekitar dengan memahami dan mendalami serta memecahkannya sendiri adalah bentuk kita terhindar dari doktrin yang salah. Saya adalah remaja yang sangat suka berorganisasi, bekerja sama dengan tim, mengambil keputusan bersama, sampai membuat project yang bisa membranding organisasi akan eksistensinya dan menjadi dampak bagi masyarakat disekitarnya. Disiplin , ketekunan, kesabaran, kerjakeras, dan percaya diri adalah modal awal saya dalam mengerjakan segala sesuatu yang dipercayakan. Saya yakin bahwa Amanah tidak akan pernah salah Pundak. Dari pengalaman saya berorganisasi sangat membantu saya untuk mengupgrade diri saya mulai dari kemampuan untuk menjadi pribadi yang fleksibel, kemampuan public speaking meningkat, kemampuan membangun relasi, memanajemen waktu dan diri sendiri, dan masih banyak lagi. Dari kekonsistenan kita menjalankan apa yang menjadi tanggungjawab kita dengan ketekunan, maka promosi dalam jabatan di organisasi pun diberikan. Saya mulai belajar bahwa tidak ada yang didapatkan secara instan, semuanya membutuhkan proses sebagai tahapan – tahapan yang harus dilalui untuk membentul softskill dan hardskill kita. Saya percaya bahwa ketika kita setia dengan perkara yang kecil maka kita akan dipercayakan dan mampu mengerjakan perkara yang besar. Hal ini bisa saya rasakan ketika saya mulai mencoba mengikuti kegiatan organisasi secara online, mulai dari Ambassador di Literasi Psikologi Indonesia, dinaikkan menjadi Head of Ambassador Literasi Psikologi Indonesia, serta dipakai menjadi MC/Moderator dalam kegiatan webinar/Instagram dan diberikan penghargaan sebagai “Best ambassador Literasi Psikologi Indonesia”. Saya juga pernah menjadi Ambassador di Grow Up Together Media, MC/Moderator, lalu ditawarkan menjadi Partnership & Marketing di platform tersebut. Hal ini pun terus berjalan dimana saya juga ditawarkan oleh Platform Mentari Psycenter yang bergerak dalam kesehatan mental untuk menjadi co-head of Public Relation (tim pendiri platform ini) serta dipercayakan untuk menjadi perwakilan dalam berkolaborasi dengan platform lainnya. Saya juga dipilih menjadi peserta penerima beasiswa mentoring dari platform Kakak Tingkat mengenai Leadership selama 1 bulan.  Waktu SMA pun saya secara konsisten menjadi anggota Paskibraka, dipercayakan membawa baki, lalu ditawarkan menjadi Pembina paskibraka. Saya pun diberi penghargaan berupa sertifikat anggota dan Pembina Paskibraka. Selain itu, saya juga memiliki semangat belajar, ambisi yang tinggi, dan mencoba hal baru. Saya waktu SMA mencoba untuk sekolah di Malang dengan dibantu oleh keluarga dan potongan SPP di sekolah. Saya yang adalah siswa dari NTT mengalami culture shock dan melatih diri saya sendiri untuk beradaptasi. Akan ada banyak hal yang kita temui di luar zona nyaman kita. Bertemu dengan orang baru serta cerita kehidupan mereka membuat saya untuk lebih belajar menghargai, bersyukur, serta memanfaatkan setiap kesempatan yang ada. Saya sadar bahwa tidak semua usaha yang kita lakukan akan memberikan hasil yang sesuai dengan ekspetasi kita. Tapi saya selalu menerapkan law of attraction dan stoicism. Sehingga saya tidak mau membebankan diri saya sendiri jika memang akan ada banyak hal yang tidak bisa kita kendalikan. Karena saya menyadari dan menerima realita tersebut. Selepas dari SMA saya pun melanjutkan Pendidikan sarjana saya di Universitas Nusa Cendana yang mengambil jurusan Psikologi. Saya ingin mempelajari manusia serta lingkungannya yang dipandang melalui sudut mental. Banyak dari kita menilai sesuatu dari apa yang nampak saja. Padahal banyak hal disekitar kita bagaikan gunung es yang hanya terlihat permukaan puncak gunungnya saja. Di bawah gunung tersebut masih ada banyak hal yang harus ditelusuri. Itulah mengapa saya sangat bangga dan bersyukur kepada Tuhan atas ijinnya dalam mengambil jurusan ini. Dari pengalaman hidup ini mengubah saya daei Delvy yang pendiam dan tidak banyak berkontribusi menjadi sosok yang aktif, tidak pemalu/pendiam, dan menjadi pribadi yang lebih baik dari sebelumnya. ',	'mimpi terbesar saya adalah saya bisa melanjutkan Pendidikan S2 (magister) di luar negeri serta membuat biro konsultasi Psikologi sambil menjadi dosen. \r\n\r\nCara saya mewujudkan mimpi tersebut adalah saya memulai dengan meningkatkan kemampuan saya dalam Bahasa inggris. Mulai dengan mengikuti Latihan online TOEFL/IELTS, mengikuti webinar yang pembicaranya adalah mereka yang mendapatkan beasiswa dalam melanjutkan Pendidikan magisternya di luar negeri, membangun relasi dengan mahasiswa Psikologi dari berbagai universitas melalui kepanitiaan dalam organisasi, mulai bertekun untuk memahami setiap mata kuliah selama proses perkuliahan berlangsung, belajar public speaking untuk membantu saya terbiasa dalam proses wawancara, serta mengikuti berbagai lomba baik itu secara online seperti berbicara mengenai isu kesetaraan gender yang dibuat oleh PLAN dan mengikuti lomba Lomba Karya Tulis Ilmiah Nasional yang diselenggarakan oleh Univ sendiri.  Selain itu saya mulai konsisten dan meningkatkan nilai IPK saya setiap semesternya. Ketika berbicara mengenai dosen, mengajar sendiri merupakan passion saya. Dari kecil saya suka sekali mengajar orang yang membutuhkan penjelasan saya. Dan saya adalah tipe orang yang mengajar dengan mengandalkan komunikasi dua arah dimana tidak hanya saya saja yang berbicara tetapi memancing mereka untuk berpikir secara aktif dan kritis dalam apa yang saya ajarkan. Dimana goal saya adalah mereka tidak hanya belajar untuk mendapatkan nilai atau validasi dari orang lain tetapi mereka benar – benar mengerti dari proses belajar yang telah dilaksanakan. Hal ini pun terbawa ketika fakultas saya mengadakan kegiatan KKBM (Kerja Kemah Bakti Mahasiswa). Dimana dalam program yang dilaksanakan, saya memilih untuk mengajar di SD Advent Dwi Abdi Malang selama 2 minggu lamanya. Setelah itu beberapa bulannya saya Kembali ke NTT untuk melaksanakan perkuliahan secara offline. Saya adalah orang yang penuh dengan persiapan sehingga apa yang saya bagikan kepada orang lain harus saya pelajari dan pahami terlebih dahulu. Agar penyampaian materinya bisa dimengerti oleh para pendengar. Selain daripada itu saya percaya bahwa tidak ada hasil tanpa proses. Maka proses sangat penting dalam kita menjalani kehidupan. Saya juga percaya bahwa apa yang kita lakukan mungkin saja berhasil dan mungkin saja tidak berhasil, tetapi jika kita tidak mencobanya sudah pasti kita gagal. Maka mencoba daripada mengapa, daripada mengapa tak mencoba. Semakin bertambahnya usia saya percaya bahwa kesempatan tidak datang begitu saja, tetapi membutuhkan Langkah kaki dengan hati yang yakin dan berani untuk menjemput kesempatan yang ada. Saya tidak pernah takut untuk mencoba hal yang baru selama hal yang saya coba adalah sesuatu yang positif serta memberikan dampak bagi lingkungan sekitar saya. Selain itu saya juga meningkatkan kemampuan berorganisasi saya dalam kampus dengan menjadi bagian dari BEM (sekretais bidang penalaran & Keilmuan) dan bagian HMP (Coordinator divisi seni). Selain itu saya juga berusaha untuk bisa dapat beasiswa S2 untuk melanjutkan profesi dan mendapat surat ijin untuk membangun biro Psikologi. Selain itu saya dibimbing oleh salah satu dosen Psikologi yang membangun biro Psikologi di Kupang, NTT yang menjadi sumber informasi buat saya dalam mempersiapkan diri untuk kedepannya\r\n',	'Ya saya memiliki pengalaman dalam berorganisasi. Saya memulai berorganisasi ketika saya harus merantau untuk melanjutkann Pendidikan SMA saya di kota Malang, tepatnya Jawa Timur. Pada tahun 2017 saya mengikuti MOS (Masa Orientasi Siswa) di Malang Adventist Academy. Setelah mengikuti MOS, seminggu kemudian saya mendapat surat terpilih menjadi anggota Paskibraka di sekolah. Saya mengikuti kegiatan ini dengan disiplin dan penuh ketekunan hingga saya yang awalnya hanya menjadi anggota biasa dalam barisan, terpilih untuk membawa baki, lalu selama proses Latihan saya terpilih untuk menjadi pengibar bendera, dan pada tahun 2019 tepatnya saya diangkat menjadi Pembina Paskibraka dan pada tahun 2020 saya mendapat sertifikat penghargaan sebagai anggota sekaligus Pembina dalam Paskibraka Sekolah. Di sekolah kami pun kami diwajibkan untuk mengikuti Live In sebagai program tahunan dari sekolah. Dalam program ini kami pun disuruh tinggal bersama dengan orang pedesaan tepatnya di daerah Malang Selatan untuk membantu mereka dalam pekerjaan mereka (waktu itu saya mendapat orang tua petani kopi & cengkeh). Kami tinggal disana kurang lebih satu minggu. Kami harus membiasakan diri dengan pola hidup mereka dan belajar sederhana. Selain itu, pada tahun 2018 saya tergabung dalam paduan suara sekolah serta group pemain angklung. Dari kegiatan yang telah saya ikuti akhirnya saya dipilih oleh kawan sekelas untuk menjadi ketua kelas mereka (yang mana saya merupakan orang timur dan dipercayakan memimpin mereka yang dari jawa). Saya menjalankan amanah sebaik mungkin, hingga pada akhirnya kelas kami mendapatkan juara 1 lomba menghias kelas indah dan beredukasi. Saat tahun 2019 akhir sekolah kami mengadakan pensi dimana saya dipilih menjadi ketua dance mix traditional dan modern serta menjadi wakil ketua pensi yang diselenggarakan. Setelah saya lulus  dari sekolah saya melanjutkan Pendidikan di Universitas Nusa Cendana di NTT dengan jurusan Psikologi. Di semester 3 tahun 2021 kami diwajibkan untuk mengikuti kegiatan KKBM (Kemah Kerja Bakti Mahasiswa). Saat itu saya memilih SD Advent Dwi Abdi Malang sebagai tempat saya melaksanakan KKBM ini selama 2 minggu lamanya. Saya sadar bahwa passion saya ada pada mengajar. Setelah kegiatan KKBM ini selesai saya pun memutuskan untuk kembali ke NTT untuk melanjutkan perkuliahan secara offline. Pada tahun 2020 saya mengikuti seleksi ambassador yang diselenggarakan oleh Literasi Psikologi Indonesia (LPI). Saya terpilih menjadi anggota saat itu dengan masa kontraknya 1 bulan. Setelah 2 minggu berjalan ternyata Head off Ambassador mengalami kendala dalam memenage waktunya dan saya ditelpon oleh founder LPI untuk menjadi Head of Ambassador LPI yang baru untuk menyelesaikan masa bakti selama sebulan dengan menandatangani kontrak yang ada dan menghandle lebih dari 30 anggota yang usia mereka lebih jauh dari saya bahkan ada yang kerja dan berpendidikan S2. Selesai masa bakti habis saya diberi penghargaan sebagai Head Of Ambassador LPI & Best of Ambassador LPI  melalui sertifikat yang diumumkan saat graduation day. Setelah itu saya juga dipanggil Kembali untuk menjadi MC dalam proses perekrutan staff & ambassador baru dan menjadi moderator dalam Live Instagram yang dilaksanakan. Pada tahun yang sama juga setelah masa bakti saya selesai di LPI, saya pun tertarik untuk mengikuti seleksi Ambassador Grow Up Together Media (GUPMedia). Yang membuat saya tertarik adalah benefit yang ditawarkan. Dimana kami disuruh untuk membuat program sendiri dan akan difasilitasi secara penuh oleh GUPMedia sendiri. Ternyata saya lolos seleksi dan mengusulkan program Live Instagram dengan tema REALTalk (Rooms Of Millenial Talk). Tujuan dari program saya untuk memberikan ruangan bagi para millennial diluar sana untuk speak up atau memberikan inspirasi kepada masyarakat mengenai isu – isu sosial. Dengan maksimal 12 kali Live Instagram yang saya adakan setiap minggunya selama 4 bulan masa bakti. Saya menggandeng HRD, Duta Genre Manado, Riau, DKI Jakarta, Suta Bahasa, NTT, Duta Mojang ,dll. Hal yang membuat saya bangga adalah ketika program saya mendapatkan antusias/respon yang positif yang tinggi dari masyarakat di sosmed membuat founder dari GUPMedia pun menawarkan diri untuk menjadi salah satu pembicara di Live Instagram saya. Ketika saya selesai masa bakti saya pun, saya dihubungi langsung oleh Foundernya untuk menjadi bagian dari GUPMedia sebagai tim Partnership & Marketing tanpa melalui seleksi. Serta menjadi moderator dalam kegiatan Live Instagram dari platform mereka. Setelah saya menyelesaikan masa bakti saya. Ternyata ada anggota LPI yang menjalankan program S2 di Gunadarma ingin membuat sebuah platform yang bergerak di bidang kesehatan mental. Nama platform ini adalah Mentari Psycenter. Saya pun mendapatkan pesan secara langsung untuk menjadi bagian pendiri dari platform tersebut sebagai co-head of public relation selama 6 bulan lamanya. Saya pun dipercayakan untuk mewakili platform tersebut berkolaborasi dengan salah satu biro Psikologi dan menjadi MC diacara webinar atau moderator di Live Instagram. Selain itu saya pun ingin untuk aktif di kegiatan kampus, salah satunya adalah Badan Eksekutif Mahasiswa (BEM). Saya pun terpilih menjadi sekretaris bidang Penalaran dan keilmuan. Setelah itu saya juga dipilih dari prodi untuk menjadi coordinator divisi seni di prodi Psikologi. Yang membuat sata beryukur adalah saya mendapatkan beasiswa mentoring dari Kakak Tigkat yang dipimpin oleh seorang pembicara TEDx lulusan Universitas Pertamina dengan tema Leadership. Dari kegiatan yang telah saya lewati ini masih banyak yang belum saya ceritakan. Tetapi saya percaya ketika kita mampu bertekun dan konsisten dalam tugas dan tanggungjawab kita maka kita akan berproses secara bertahap untuk dinaikkan/dipromosikan pada jabatan tertentu dalam organisasi. Saya percaya bahwa mulai dari bawah tidak ada salah nya. Tidak harus kita memaksakan diri dengan jabatan yang tinggi. Saya yakin amanah tidak akan salah pundak. Dan ketika kita menjalankan amanah yang ada bukan untuk mendapatkan validasi tetapi melakukannya dengan sepenuh hati maka akan dilancarkan. Dari pengalaman berorganisasi ini pun mengajarkan saya untuk berani tampil didepan banyak orang, berani menyampaikan pendapat, berani speak up, meningkatkan kemampuan public speaking, melatih diri untuk fleksibel dan mampu beradaptasi dengan tim yang memiliki background berbeda. Meningkatkan kemampuan saya bekerja sama dalam tim, bahwa tidak bisa untuk menghandle semuanya dan belajar percaya pada anggota setim untuk melaksanakan tugas dan bagiannya. Dari setiap program organisasi yang saya ikuti pun sangat menambah  wawasan dan menambah relasi dengan mereka yang diluar NTT. Begitulah sekiranya pengalaman berorganisasi saya. Selebihnya saya mohon maaf jika dalam penyampaian saya terdapat kata – kata yang tidak berkenan buat kakak sekalian. Semoga saya bisa diijinkan mengikuti program beasiswa ini bukan karena merujuk pada nilai beasiswa yang dikasih tetapi benefit pelatihan lainnya yang akan meningkatkan kemampuan hardskill & softskill saya dalam persiapan dunia kerja kedepannya.',	1,	1655300718,	NULL,	0),
('SCHLR-DLYNN-a89f98',	'USR-DLYNN-a3ed1',	'Ade Lya Ananta',	'2004-01-04',	'8991604319',	'Jl. Parit lintang dusun cempaka desa kalimas, kecamatan sungai kakap , kabupaten kubu raya , kota Pontianak, Kalimantan barat',	'Ilmu komunikasi',	'Universitas Tanjungpura',	'0.00',	'1',	'Nama saya Ade Lya Ananta , bisa dipanggil ananta , saya berasal dari desa yang berada di kalimantan barat , saya lahir pada tanggal 4 januari 2004  dan kini saya  berusia 18 tahun . saya merupakan siswa yang baru saja lulus dari bangku smk dan juga sudah lulus masuk universitas melalui jalur snmptn , namun saya belum aktif berkuliah dikarekan perkuliahan belum aktif dimulai .',	'mimpi terbesar saya adalah saya ingin menyelesaikan S1 saya sesuai dengan target saya sendiri yaitu 3 tahun setengah , dan setelah lulus dari S1 saya memiliki cita cita besar yaitu melanjutkan S2 saya di luar negeri melalu beasiswa dan memiliki sebuah pekerjaan agar saya dapat membantu perekonomian keluarga saya . \r\n\r\ncara saya mewujutkannya yaitu saya selalu giat belajar dan mencari informasi mengenai matkul apa saja yang akan saya pelajari di setiap semesternya dan saya juga mulai belajar  beberapa bahasa baru untuk menambah wawasan dalam berbicara dan juga untuk mempersiakan beasiswa S2 saya nantinya .  ',	'Iya saya memiliki pengalama dalam berorganisasi . saya mernah mengikuti organisasi osis, di osis saya menjabat sebagai wakil sekertaris osis , hal hal yang saya lakukan adalah membantu ketua sekretaris dalam membuat surat , dokumen dan membuat proposal acara . dan juga banya kegiatan lain yang saya lakuakan .',	1,	1653628051,	NULL,	0),
('SCHLR-DMHMM-3086b4',	'USR-DMHMM-415dd',	'ade muhammad imam',	'1994-03-07',	'81221252297',	'Babakan Sindang Rasa RT05 RW 14 no 59 Desa Cibiru Wetan Kecamatan Cileunyi Kabupaten Bandung',	'ilmu komunikasi ',	'Sangga Buana YPKP Bandung',	'3.85',	'7',	'saya seorang mahasiswa disabilitas daksa yang mempunyai dedikasi tinggi terhadap personal diri bagi disabilitas terutama pendidikan ',	'menjadi dosen dan rektor ui',	'bergabung aktif dalam organisasi pecinta alam pada waktu sma dan menjadi relawan LSM lokal dalam program disabilitas siap bekerja ',	1,	1654165623,	NULL,	0),
('SCHLR-DN-5611e6',	'USR-DN-3911aa',	'Diana Nurzaliza ',	'2004-01-04',	'82164479972',	'JL KL YOS SUDARSO LINGK III ',	'S1 KIMIA/FMIPA ',	'Universitas sumatera utara ',	'3.14',	'2',	'Perkenalkan nama saya Diana Nurzaliza saya mahasiswa universitas sumatera utara prodi S1 KIMIA semester 2, Saya mengikuti organisasi Msc fmipa sebagai anggota psdm dan saya mengikuti organisasi diluar kampus yaitu remaja mesjid sebagai anggota, saya sangat antusias untuk mencoba hal hal yang baru dan yang menantang, dan sangat mudah berbaur terhadap orang lain, saya kuga orang yang pekrja keras dan tidak mudah menyerah ketika yang saya lakukan sangat sulit untuk dilakukan saya lakukan\r\nMenurut saya untuk masuk di universitas sumatera utara tidak mudah bagi saya karena harus bersaing dengan seluruh siswa siswi diindonesia dengan mengandalkan nilai rapot saja, ketika saya lulus hal tersebut menjadi kebanggaan untuk diri saya sendiri sudah mendapatkan hasil usaha saya',	'Mimpi Terbesar saya untuk menjadi orang yang bermanfaat, cara saya mewujudkan nya dengan 3 hal yaitu usaha, doa dan tawakkal\r\nKarena setiap usaha yang saya lakukan akan saya iringi dengan doa dan tak lupa saya untuk bertakwa agar kelak saya menjadi orang yang bermanfaat bagi saya sendiri,dan orang lain',	'Saya mempunyai Pengalaman Organisasi dikampus dan luar kampus untuk dikampus jika adanya rapat dan event event lainnya  hanya dapat dilakukan dengan cara online karena ada nya pandemi \r\nUntuk diluar kampus saya bergabung di organisasi ini di kelas 10, untuk pengalaman nya yang saya dapat saya mudah berinteraksi antara relawan dengan masyarakat sekitar ',	1,	1655698791,	NULL,	0),
('SCHLR-DNDPT-071f77',	'USR-DNDPT-556a1',	'Dinda Putri Agustin ',	'2004-03-24',	'88809309561',	'jl. raya pulogebang rt11 rw03 n0.48 cakung',	'komunikasi',	'institut pertanian bogor',	'0.00',	'1',	'Nama saya Dinda Putri Agustin, seringkali dipanggil Dinda. Saya memiliki minat yang tinggi dalam bidang bisnis dan manajemen. Sejak SMP, saya selalu mencari peluang bisnis. Beberapa bisnis yang pernah saya jalani antara lain cemilan kering, gantungan kunci, dan online shop. Tak berhenti sampai situ, saya juga bergabung dalam klub entrepreneur sewaktu sekolah. Ketika waktu luang, saya selalu berusaha untuk mempelajari hal-hal baru yang bisa mendukung bisnis saya. Contohnya adalah digital marketing dan social media marketing.',	'mimpi terbesar saya saat ini adalah masuk perguruan tinggi negeri tanpa tes dan saya berhasil mewujudkan mimpi terserbut dengan cara giat belajar dan selalu mengikuti  lomba, kompetisi, olimpiade didalam ataupun diluar sekolah. alhasil saya mempunyai banyak pretasi dan pengalaman setelah lulus dari sekolah tersebut.',	'iya, saya bergabung sejak 2019 hingga sekarang ke dalam Masyarakat Relawan Indonesia atau yg sering disebut relawan MRI. relawan MRI tidak hanya bergerak dalam bidang aksi kemanusiaan, tetapi juga memberikan ilmu di bidang pendidikan kepada anak-anak terlantar yg tidak bersekolah serta relawan MRI juga ikut membantu warga negara Palestina yg terjajahi. selain itu, relawan MRI juga kerap membantu warga indonesia khususnya jabodetabek yang sering terkana bencana banjir.',	1,	1654557902,	NULL,	0),
('SCHLR-DNDRL-147007',	'USR-DNDRL-35d3f',	'Adinda Aurelia Arifin',	'2002-10-29',	'81584233346',	'Bumi Sentosa Blok D7/27 Cluster Jupiter, Nanggewer Mekar, Cibinong, Bogor. 16912',	'Program Studi Pendidikan Kedok',	'Universitas Sriwijaya',	'3.73',	'4',	'Perkenalkan saya Adinda Aurelia Arifin tinggal di kota Bogor, lahir pada tanggal 29 Oktober 2002. saya mahasiswa semester 4 di Universitas Sriwijaya jurusan Pendidikan Kedokteran Gigi, Fakultas Kedokteran dengan nilai akademik yang baik dimana saya memiliki cita-cita dapat melanjutkan studi S2/Spesialis Bedah Mulut.\r\nSaya Adinda anak ke 3 dari 3 bersaudara dimana kondisi ekonomi cukup berat bagi keluar karena orang tua harus menyekolahkan 2 saudara, oleh karena itu untuk meringankan orang tua saya berharap dapat memperoleh beasiswa.\r\nSaya dalam hal akademik memiliki nilai yang memuaskan yaitu memperoleh ipk sebesar 3,73 karena saya terus memotivasi diri sendiri agar terus berjuang dengan apa yang sedang saya jalankan. \r\nHarapan saya dapat meringankan orang tua dalam hal biaya kuliah dan menjadi kebanggaan orang tua dimana anak pertama yang dapat gelar drg. (dokter gigi) di keluarga saya.\r\nSaat ini bidang kesehatan memerlukan perhatian yang cukup besar semenjak pandemi, oleh karena itu saya ingin menjadi dokter gigi dengan reputasi lulusan terbaik. Saya ingin menguasai keahlian dalam bidang kesehatan untuk membuat suatu langkah perubahan pada sistem kesehatan di Indonesia.\r\nSelain masalah keuangan menjadi dorongan kuat untuk mendapatkan beasiswa, akan tetapi saya memiliki minat bakat yang saya yakini mampu untuk kuliah dengan baik serta dapat lulus menjadi sarjana yang memiliki spesifik keahlian dalam bidang kesehatan.',	'Keinginan awal saya untuk memilih jurusan Pendidikan Kedokteran Gigi sebagai tempat saya untuk melanjutkan pendidikan saya berasal dari kecintaan saya untuk menolong orang lain yang sedang membutuhkan pertolongan dan keinginan saya untuk bisa berinteraksi dengan orang lain selain itu karena saya melihat masih banyak yang belum mengetahui mengenai pentingnya kesehatan gigi dan mulut.\r\nMenurut saya menjadi seorang dokter adalah salah satu jalan yang sangat tepat untuk mewujudkan keinginan saya ini. Cita-cita ini mulai saya miliki semenjak duduk di bangku Sekolah Menengah Atas kelas 2.\r\nBagi saya sendiri menjadi seorang mahasiswa kedokteran adalah suatu tugas yang cukup berat yang harus saya emban. Ilmu kedokteran adalah ilmu yang meyangkut kesehatan dan keselamatan nyawa manusia. Yang artinya tidak ada satupun ilmu yang main-main yang saya dapatkan di fakultas ini. Semua ilmu tersebut berazaskan satu hal yaitu nyawa manusia. Bukanlah hal yang mudah untuk menjadi terampil dalam hal ini. \r\nMenjadi seorang mahasiswa kedokteran mengajarkan saya betapa berharganya nyawa manusia itu dan betapa banyaknya hal-hal yang ternyata masih belum kita ketahui mengenai diri manusia itu sendiri dan yang pasti mengajarkan saya betapa luar biasanya Tuhan Yang Maha Esa yang mampu menciptakan manusia dengan detil dan sesempurna ini. Dengan menjadi seorang dokter, saya menganggap ini juga menjadi sebuah ibadah dengan melayani makhluk ciptaan Tuhan yang paling sempurna.\r\nApabila Tuhan berkenan saya ingin melanjutkan pendidikan ke jenjang yang lebih lanjut yaitu jenjang Pendidikan Profesi Dokter Gigi Spesialis dan mengambil spesialis bagian Bedah Mulut. Untuk menggapai cita-cita tersebut pasti tidak mudah, oleh karena itu untuk menggapai cita-cita tersebut saya menentukan tujuan-tujuan kecil untuk membantu dalam menyusun rencana mengenai hal apa saja yang akan saya lakukan lalu merincikan perencanaan secara bertahap. Selain itu, selalu percaya dengan kemampuan yang dimiliki, selalu haus akan ilmu serta pengalaman dan memperluas jaringan sosial atau networking agar dapat berhubungan dengan banyak orang baru.',	'Nama saya Adinda Aurelia Arifin saya akan menceritakan pengalaman saya dalam mengikuti organisasi. Menurut saya berorganisasi itu pasti pernah dilakukan setiap orang yang sering berinteraksi. Pengalaman berorganisasi maupun menjadi relawan pernah saya dapatkan.\r\nPengalaman saya berorganisasi yang pertama yaitu, saya mengikuti organisasi mahasiswa BEM. Waktu itu saya masih menjabat sebagai anggota tetap, pengalaman saya dalam mengikuti BEM sangat banyak salah satunya menjalankan setiap program kerja serta menjadi panitia di setiap kegiatan yang diadakan oleh BEM. Dan sekarang saya menjabat sebagai Wakil Kepala Departemen dimana tanggung jawab saya disini sangat besar.\r\nPengalaman saya berorganisasi yang kedua yaitu, saya mengikuti organisasi Persatuan Senat Mahasiswa Kedokteran Gigi Indonesia (PSMKGI) yang merupakan satu-satunya organisasi mahasiswa Kedokteran Gigi se-Indonesia yang mewadahi aspirasi dan ranah gerak mahasiswa kedokteran gigi di Indonesia. Pada organisasi ini saya menjabat sebagai anggota dan belum memiliki banyak pengalaman karena baru beberapa minggu saya menjabat di dalam organisasi PSMKGI ini.\r\nSelanjutnya, pengalaman saya menjadi relawan salah satunya yaitu, ikut serta dalam kegiatan Bulan Bakti 2021 yang diadakan oleh Ikatan Senat Mahasiswa Kedokteran Indonesia (IMSKI) dimana saat itu saya mengikuti beberapa acara seperti mengedukasi masyarakat mengenai isu kesehatan yang sering terjadi dan juga cara penjegahannya.\r\nBanyak sekali hal yang berkesan yang tidak saya dapatkan sebelumnya. Oleh karena itu, saya sangat senang dapat aktif berorganisasi karena tidak semua orang memiliki pengalaman yang mengesankan seperti ini, dan saya sangat menikmatinya.',	1,	1655707034,	NULL,	0),
('SCHLR-DNDSP-c56bcf',	'USR-DNDSP-fa942',	'Dendi Saputra ',	'2003-07-27',	'83173839353',	'Jl.semangka.rt.20.rw.03,kel.padang serai.kec.kampung Melayu ',	'Accounting ',	'SMKN NEGERI 5 KOTA BENGKULU ',	'8.4',	'1',	'Assalamualaikum warahmatullahi wabarokatuh sebelumnya perkenalkan nama saya dendi Saputra dari SMKN NEGERI 5 KOTA BENGKULU,saya lahir pada tanggal 27-07-2003 Jakarta.\r\nCita-cita saya ingin menjadi seorang pengusaha yang sukses ',	'Mimpi saya ingin menjadi seorang pengusaha yang sukses dan saya terus belajar sungguh-sungguh ',	'Iya pernah nama organisasi BNN {BADAN NARKOTIKA NASIONAL}',	1,	1655138809,	NULL,	0),
('SCHLR-DNLNN-c8e1e0',	'USR-DNLNN-b31fb',	'Daniel Nainggolan ',	'2000-03-16',	'81339590506',	'Jln Graha Udayana Gang IV No 18 Jimbaran Kuta Selatan Badung Bali 80361 Indonesia ',	'Agroekoteknologi/Pertanian ',	'Universitas Udayana ',	'3.72',	'4',	'Nama saya Daniel Nainggolan biasanya dipanggil Daniel. Saya berasal dari keluarga sederhana dari desa terpencil di Sumatera Utara yang mencoba mencari pengalaman baru dengan berkuliaj di salah satu Universitas terbaik di Indonesia. Saya adalah seorang mahasiswa aktif di salah satu perguruan tinggi Indonesia, yaitu Universitas Udayana. Sekarang saya sedang menempuh s-1 dengan jurusan pertanian. Saya adalah seorang mahasiswa yang  aktif dalam organisasi kampus dan kegiatan luar kampus lainnya, salah satu kegiatan kampus yang aktif saya ikuti adalah menjadi staf HRD SRE Udayana, Koordinator Kepanitiaan UKM Koperasi Udayana dan lain-lainnya.\r\nSaya memiliki sifat dan kepribadian yang tidak mudah menyerah,bertanggungjawab, imajinatif, berpikir kreatif,.memiliki problem solving terhadap masalah yang sedang dialami dan tidak mudah menyerah.\r\nMakanan favorit saya adalah manuk napinadar, salah satu makanan tradisional dari Sumatera Utara. ',	'Mimpi terbesar saya dalam hidup adalah menjadi orang yang berguna dan berdampak positif bagi lingkungan sekitar.\r\nSecara spesifik mimpi yang menjadi mimpi terbesar saya adalah memiliki perusahaan yang bergerak di bidang pelayanan kesehatan dan pendidikan ',	'Iya, saya memiliki beberapa pengalaman organisasi, Kepanitiaan, volunteer dan beberapa kegiatan pengabdian kepada masyarakat yang saya ikuti selama di perkuliahan baik kegiatan kampus maupun luar kampus.\r\nSalah satu pengalaman berkesan selama kegiatan kampus yaitu relawan mengajar Udayana di desa terpencil di daerah Bali',	1,	1654232926,	NULL,	0),
('SCHLR-DNNKT-46bcbd',	'USR-DNNKT-9c4f5',	'Dina Nakita',	'2001-05-28',	'83154913445',	'Nglempongsari,  Sariharjo,  Ngaglik,  Sleman,  Yogyakarta',	'Komunikasi Penyiaran Islam/ Fa',	'UIN Sunan Kalijaga',	'3.75',	'6',	'Perkenalkan saya Dina Nakita, Mahasiswi jurusan Komunikasi dan Penyiaran Islam UIN Sunan Kalijaga Yogyakarta.  Saat ini saya bertempat tinggal di Yogyakarta. \r\nSaya menyukai bidang radio dan kegiatan pengabdian dan  Kepenulisan. Disamping itu, saya memiliki keinginan yang kuat untuk belajar dan terus mengembangkan potensi diri melalui mentoring, upgrading skill dan intership. Sehingga saya percaya dapat mengikuti beasiswa pemuda by youthbreaktheboundaries.',	'mimpi terbesar saya adalah dapat menjadi inspirasi, memberikan motivasi dan berbagi ilmu kepada pelajar maupun mahasiswa yang memiliki keinginan untuk terus belajar dan mengembangkan diri. Oleh karena itu saya saat ini  berusaha untuk terus belajar dan mengembangkan diri terlebih dulu dengan terjun di berbagai bidang baik yang diminat pada bidang radio dan pengabdian masyaraat maupun mencoba hal-hal lainnya yang belum saya bisa.',	'Pada  tahun ketiga kuliah  saat ini saya aktif mengikuti komunitas kampus di radio Rasida FM dan Pusat Layanan Difabel (PLD). Diluar kampus saya pernah tergabung  dalam Komunitas Peduli Inklusi Nusantara (KOPINUS) 2019-2021 dan Youth Rangers Indonesia (YRI) Angkatan 2019). diluar komunitas, saya juga mengikuti kegiatan volunteer Terjun Desa KPSP Jogja periode Januari 2022  dan Ekspedisi Jejak Budaya #2  Bromo  Reswara Indonesia periode Maret 2022.',	1,	1654849094,	NULL,	0),
('SCHLR-DNRCS-0aacf8',	'USR-DNRCS-b6ce8',	'Dinar Cesiasih',	'2001-09-04',	'88972101794',	'Jl. Salya, Cilacap Utara, Jawa Tengah ',	'Teknik Industri/FTTI',	'Universitas Jenderal Achmad Ya',	'3.85',	'4',	'Sejak kelas 3 SD saya menyukai pelajaran Matematika dan mendapatkan nilai UAS 96. Sejak itu juga saya senang membantu mengajarkan teman yang belum paham dengan materi yang disampaikan guru dan saya selalu mengedepankan pendidikan. Pada Ujian Nasional alhamdulillah saya peringkat 1 paralel dengan nem 27,5 (3 mapel) dan nilai UN Matematika 9,5. Pada saat UNBK SMP saya terus mengejar nilai Matematika agar mendapatkan nilai sempurna. Sambil menunggu pengumuman, saya mengajarkan saudaraku kelas 6 SD yang pada saat itu juga sedang Ujian Nasional. Setelah tiba saatnya pengumuman UNBK, alhamdulillah saya mendapatkan nilai Matematika 100 dan diterima di SMA negeri terfavorit se-Kabupaten Cilacap serta saudara saya diterima di salah satu SMP negeri favorit di Kabupaten Cilacap. Masuk sekolah negeri terfavorit di Kabupaten Cilacap dengan nilai UNBK yang tinggi adalah kebanggaan tersendiri pada saat itu karena angkatan saya belum terdapat aturan Zonasi sehingga daya saing untuk masuk sekolah terfavorit sangatlah ketat. Saudara saya merasa puas dengan apa yang saya terangkan, ibunya meminta saya untuk menjadi guru les privatnya yaa dengan biaya yang cukup untuk uang jajan saya pada saat itu. Awalnya hanya les privat matematika (dengan bayaran), lama-lama semua mata pelajaran saya bantu ajarkan dan tanpa bayaran. Saya ikhlaskan karena tujuan awal saya membantu tanpa mengharapkan imbalan. Alhamdulillah anak tersebut diterima di salah satu SMA negeri favorit di Kabupaten Cilacap, sedangkan saya hanya bisa berusaha dan berdoa agar bisa lolos PTN dengan KIP-K. Karena ekonomi orang tua kurang mampu, saya tidak bisa les privat untuk persiapan UTBK, saya hanya mengandalkan otak saya untuk belajar mandiri yang sebenarnya saya butuh sekali les privat. Akhirnya, saya tidak diterima di PTN. Jalur mandiri pun tidak lolos karena saya pemegang KIP-K. Alhamdulillah saya lolos di Universitas Jenderal Achmad Yani Yogyakarta dengan jalur KIP-K. Saat ini saya membantu mengajarkan Matematika ke saudara saya yang masih duduk di kelas 4 SD. ',	'Impian terbesar saya adalah bisa berpendidikan setinggi-tingginya dan bisa lolos beasiswa AAS untuk S-2. Dari SD sampai SMP saya selalu mendapat uang saku 2 ribu. Pada saat SMP saya sering puasa Senin Kamis tujuannya untuk menghemat uang. Ketika teman saya istirahat membeli jajan, saya hanya duduk dikelas sambil membaca buku. Selama 5 tahun saya tidak dinafkahi oleh bapak saya. Dari situ saya belajar sabar dan ikhlas menerima kenyataan. Segala kegiatan mulai dari study tour sampai piknik ke Jakarta pun tidak saya ikuti. Saat SMA dimana mulai diberlakukan 5 hari sekolah dan pulang sampai jam 4 sore saya hanya mengandalkan bekal makan siang dari ibu tanpa diberi uang saku. Maka dari itu saya menerima tawaran saudara saya sebagai guru les privatnya. Uang tersebut saya tabung untuk keperluan membayar buku LKS. Saat ini untuk mewujudkan impian saya melanjutkan S-2 dengan beasiswa adalah memperbanyak mengikuti lomba, volunteer, internship, organisasi, serta mendaftar beasiswa seperti ybb scholarship ini, agar dapat mengasah soft skills maupun hard skills dan mulai membangun portofolio. ',	'Iya, saya memiliki pengalaman organisasi di Himpunan Mahasiswa Teknik Industri (HMTI) dan komunitas ruangpeduli Jawa Tengah. Di HMTI saya mengikuti 2 periode masa jabatan, periode 1 (20/21) saya menjabat sebagai staf divisi BPO&humas dan periode 2 (21/22) saya menjabat sebagai kepala divisi BPO&Humas. Pengalaman saya pada periode 1, menjadi panitia di beberapa event yaitu sebagai sekretaris, MC, sie humas, dan ketua pelaksana ie competition. Pada periode 2 sekarang ini, saya menjadi panitia di beberapa event yaitu sebagai ketua pelaksana webinar personal branding, bendahara ie competition, dan ikut berpartisipasi dalam kegiatan industrial engeneering berbagi. Saya merupakan pribadi yang suka tantangan dan mempelajari hal-hal baru, maka dari itu saya memberanikan diri untuk belajar di semua posisi tersebut dengan senang hati. Selain itu, di komunitas ruangpeduli saya menjabat sebagai anggota. Di sini saya memiliki banyak pengalaman mengenai dunia pendidikan dan menjadi relawan untuk mengumpulkan donasi berupa uang dan buku layak baca yang disalurkan untuk sekolah dasar di daerah pelosok. Berdasarkan pengalaman, saya merupakan pribadi yang senang bekerjasama secara tim maupun individu. ',	1,	1655623662,	NULL,	0),
('SCHLR-DNSDW-59d272',	'USR-DNSDW-d3ff7',	'Denisa Dwi Hanifa',	'2004-09-23',	'81546995565',	'Blok Ciloa Girang Desa Muktisari Kec. Cingambul Kab. Majalengka',	'IPA',	'MAS Persis Sindangkasih',	'0.00',	'0',	'Saya adalah pelajar tingkat SMA yang telah menyelesaikan masa studi saya dan berkeinginan besar untuk melanjutkan kuliah di jurusan yang sangat saya minati, namun saya mengalami kendala dalam masalah finansial di keluarga sehingga saya harus mencari tempat kuliah yang terjangkau. Dan jika saya tidak dapat menemukannya maka saya tidak bisa melanjutkan kuliah. Akan tetapi, saya masih memiliki mimpi yang besar sehingga saya tidak ingin menyerah begitu saja maka dari itu saya sedang berusaha mencari tempat kuliah yang cukup terjangkau dan juga mencari beasiswa untuk meringankan beban keluarga serta dapat melanjutkan sekolah saya.',	'Mimpi terbesarku saat ini adalah ingin melanjutkan kuliah di jurusan yang saya ingin yaitu psikologi ataupun farmasi dan usaha saya untuk mewujudkannya adalah dengan belajar sungguh-sungguh dan berdoa semaksimal mungkin',	'Selama saya sekolah di tingkat SMA, saya termasuk kedalam anggota dari organisasi kesehatan yang ada di sekolah yang disebut AHC (Al-Amin Healer Comunity)',	1,	1654317382,	NULL,	0),
('SCHLR-DNSNT-3da33b',	'USR-DNSNT-f15d2',	'Diana sintya maharani',	'2006-02-10',	'81223720307',	'Komp. Banyubiru blok p no 34, Kec. Mekarjaya Kel. Rancasari, Kota bandung.',	'IPS',	'SMA Terpadu Baiturrahman',	'3.29',	'2',	'Saya adalah orang yang suka mencoba hal baru dan memiliki rasa ingin tahu yang tinggi. Hobi saya terbilang banyak, saya suka melukis, membaca, berenang, menulis, bermain basket, karate, menggambar, menjahit, menanam tanaman hias dan masih banyak lagi. Kebanyakan waktu luang saya digunakan untuk melukis, karena bagi saya melukis merupana terapi dan cara saya menyalurkan emosi. Saya sangat menyukai pelajaran matematika dan sejarah, keduanya sangat menyenangkan bagi saya.',	'Sedari kecil saya ingin menjadi mentri pendidikan, sama seperti Jerome Polin, saya juga melihat bahwa sistem pendidikan di Indonesia masih belum efektif dibandingkan dengan negara lain. Kemarin saya juga berkesempatan menjadi salah satu peserta PISA, sebuah test untuk mengukur kemampuan siswa di umur yang sama di negara yang berbeda, saya menemukan masih banyak peserta PISA di Indonesia yang masih kesulitan mengerjakan soal, sedangkan bagi anak di negara lain mungkin soal ini tergolong mudah karena kurikulum nya memang berbeda. Oleh karena itu saya ingin sekali berkontribusi dalam sistem pendidikan di Indonesia. Karena mimpi saya yang sangat tinggi, saya juga perlu menambah pengalaman sebanyak-banyaknya dan menempuj pendidikan setinggi-tingginya hingga saya layak ditunjuk sebagai mentri pendidikan Indonesia di masa depan. Sedari',	'Saya pernah mengikuti Osis, ditahun pertama saya menjadi anggota sekbid 4, sangat menyenangkan membuat program-program yang dapat menjadi wadah bagi siswa mengembangkan kemampuan non-akademik nya, di tahun kedua saya menjadi sekretaris 1, saya belajar banyak hal saat saya menduduki jabatan itu, saya belajar membuat agenda, membuat proposal, menyusun acara, mempersiapkan meeting, dan banyak hal yang pastinya dapat berguna di masa depan.',	1,	1654135191,	NULL,	0),
('SCHLR-DNSNT-bf9371',	'USR-DNSNT-f15d2',	'Diana sintya maharani',	'2006-02-10',	'81223720307',	'Komp. Banyubiru blok p no 34, Kec. Mekarjaya Kel. Rancasari, Kota bandung.',	'IPS',	'SMA Terpadu Baiturrahman',	'3.29',	'2',	'Saya adalah orang yang suka mencoba hal baru dan memiliki rasa ingin tahu yang tinggi. Hobi saya terbilang banyak, saya suka melukis, membaca, berenang, menulis, bermain basket, karate, menggambar, menjahit, menanam tanaman hias dan masih banyak lagi. Kebanyakan waktu luang saya digunakan untuk melukis, karena bagi saya melukis merupana terapi dan cara saya menyalurkan emosi. Saya sangat menyukai pelajaran matematika dan sejarah, keduanya sangat menyenangkan bagi saya.',	'Sedari kecil saya ingin menjadi mentri pendidikan, sama seperti Jerome Polin, saya juga melihat bahwa sistem pendidikan di Indonesia masih belum efektif dibandingkan dengan negara lain. Kemarin saya juga berkesempatan menjadi salah satu peserta PISA, sebuah test untuk mengukur kemampuan siswa di umur yang sama di negara yang berbeda, saya menemukan masih banyak peserta PISA di Indonesia yang masih kesulitan mengerjakan soal, sedangkan bagi anak di negara lain mungkin soal ini tergolong mudah karena kurikulum nya memang berbeda. Oleh karena itu saya ingin sekali berkontribusi dalam sistem pendidikan di Indonesia. Karena mimpi saya yang sangat tinggi, saya juga perlu menambah pengalaman sebanyak-banyaknya dan menempuj pendidikan setinggi-tingginya hingga saya layak ditunjuk sebagai mentri pendidikan Indonesia di masa depan. Sedari',	'Saya pernah mengikuti Osis, ditahun pertama saya menjadi anggota sekbid 4, sangat menyenangkan membuat program-program yang dapat menjadi wadah bagi siswa mengembangkan kemampuan non-akademik nya, di tahun kedua saya menjadi sekretaris 1, saya belajar banyak hal saat saya menduduki jabatan itu, saya belajar membuat agenda, membuat proposal, menyusun acara, mempersiapkan meeting, dan banyak hal yang pastinya dapat berguna di masa depan.',	1,	1654134830,	NULL,	0),
('SCHLR-DNTSH-23f152',	'USR-DNTSH-53852',	'Adinta Shafa Salsabila',	'2003-05-18',	'83113754167',	'Jl Pandawa Timur II, Desa Pucangan, Kecamatan Kartasura, Kabupaten Sukoharjo, Jawa Tengah',	'Hukum Ekonomi Syariah',	'UIN Raden Mas Said Surakarta',	'3.91',	'2',	'Saya merupakan mahasiswa semester 2 jurusan Hukum Ekonomi Syariah di UIN Raden Mas Said Surakarta. Meskipun saya berkuliah di jurusan hukum, sebenarnya di awal masa perkuliahan saya merasa sangat kesulitan untuk menyesuaikan diri. Banyak hal dasar yang tidak saya ketahui tentang hukum ataupun ekonomi, karena dulu sewaktu SMA mengambil jurusan MIPA. Namun, ketika melihat teman-teman mampu mengikuti perkuliahan dengan baik, semangat saya pun terpantik. Saya mulai mengikuti organisasi internal kampus dan eksternal yang bergerak di bidang hukum, seperti LSO Sharia Law Community dan Persatuan Mahasiswa Hukum Solo. Disana saya banyak belajar dari orang-orang hebat. Saat ini pun, saya masih merasa kurang dan masih terus belajar baik di perkuliahan maupun di organisasi yang saya ikuti.\r\nSaya juga memiliki hobi menulis dan melukis. Saya sempat mengikuti UKM Jurnalistik satu semester kemarin, dan beberapa tulisan saya ada yang berhasil masuk ke website. Saat ini, saya sedang berusaha meningkat kemampuan berbahasa saya, terutama bahasa Inggris karena di masa sekarang, saya sadar betul betapa penting menguasai bahasa ini. \r\nDisamping itu, saya menyadari bahwa soft skill yang saya punya belum cukup mumpuni untuk menghadapi dunia kerja nanti. Maka, mulai dari sekarang saya bertekad ingin mengembangkan diri dengan meningkatkan skill melalui beasiswa YBB. Karena saya tahu, melalui beasiswa YBB, terbuka lebar peluang untuk maju satu langkah mewujudkan impian-impian saya.',	'Mimpi terbesar saya cukup sederhana, yakni ingin sukses dan bahagia. Tapi, untuk menuju kebahagiaan itu, saya tahu tidaklah mudah. Untuk saat ini, yang saya lakukan hanyalah selalu melakukan yang terbaik di setiap kesempatan. Belajar dengan baik, dimanapun dan dari siapapun. Selalu ambil setiap kesempatan yang ada, dan jika menghadapi kegagalan, saya selalu menekankan pada diri bahwa gagal adalah hal yang lumrah terjadi. Gagal artinya coba lagi.\r\nDan yang terpenting adalah saya selalu berdoa kepada Tuhan agar hidup saya bisa berguna bukan hanya untuk diri sendiri, namun juga untuk orang lain. Karena menurut saya, kebahagiaan bukan hanya sekedar saya merasa senang atas hidup saya, tetapi juga ketika saya membawa kebahagiaan untuk orang lain.',	'Saat ini saya aktif di organisasi internal maupun eksternal kampus. Organisasi internal yang saya ikuti adalah Sharia Law Community. Saya bergabung sejak semester satu perkuliahan. Disana kami belajar mengenai seluk-beluk hukum secara menyeluruh. Kegiatan yang pernah saya ikuti selama aktif menjadi anggota SLC adalah Sekolah Meja Hijau, Pelatihan Legal Drafting, Pelatihan Debat Hukum, dan masih banyak lagi. \r\nUntuk organisasi eksternal, saya bergabung menjadi anggota Persatuan Mahasiswa Hukum Indonesia cabang Solo. Sama seperti SLC, saya sudah bergabung sejak semester awal perkuliahan. \r\nSaya sempat mengikuti UKM Jurnalistik, namun di semester 2 ini saya tidak melanjutkannya karena ingin lebih berfokus di SLC. Di UKM Jurnalistik, saya ditempatkan di bawah divisi redaksi dan bertugas sebagai reporter. Saya pernah beberapa kali meliput berita dan menyusunnya menjadi straight news. Tulisan-tulisan saya yang lain berupa artikel juga pernah dimasukkan ke dalam website UKM Jurnalistik. \r\nDi masa SMA, saya pun aktif berorganisasi, diantaranya pernah menjabat sebagai Ketua OSIS SMA N 1 Margasari tahun 2018 dan Ketua MPK SMA N 1 Margasari tahun 2019. ',	1,	1654063725,	NULL,	0),
('SCHLR-DNYSD-4787ca',	'USR-DNYSD-f6c1b',	'Dany Saad A',	'2002-02-06',	'85865744581',	'Gumulan, klaten tengah, klaten',	'Admnistrasi Bisnis/FISIP',	'UPNY',	'2.88',	'2',	'Saya adalah seorang mahasiswa jurusan administrasi bisnis yang mumpuni di bidang project management dan komunikasi visual verbal. Saya pernah mendapatkan beasiswa untuk mengikuti program karantina pelatihan leadership dan pelatihan public speaking yang diadakan oleh trainer professional. Sehingga saya menguasai tentang filosofi leadership dan penerapannya. ',	'saya ingin membuka sebuah proyek property  bersama teman saya. Saya mempunyai sahabat yg sangat dekat. Kami berdua punya target untuk membuka proyek perumahan sendiri. Akhirnya teman saya mulai merintis karir menjadi seorang site manager di sebuah proyek. Dan saya merintis karir sebagai digital marketer yg nantinya kami berdua akan berkolaborasi. Saya yakin apabila ilmu dari jurusan saya dan ilmu digital marketing dipadukan akan membuat saya berkembang lebih cepat dibanding orang lain. Saya yakin apabila saya menjadi seorang digital marketer yang hebat akan membantu memperbaiki iklim perekonomian di Indonesia.  Akan tetapi, jalan untuk menuju cita cita saya terhambat ekonomi yang sedang turun. Ayah saya baru saja terkena stroke sehingga menyebabkan ayah saya tidak bisa bekerja. Padahal, ayah saya masih harus menanggung biaya ke 2 anaknya yang masih kuliah. Saya akhirnya sadar bahwa terkadang mimpi yang tinggi akan terbentur dengan realita yang pahit. Tetapi, saya belum menyerah menghadapi cobaan dan realita yang ada karena saya yakin untuk meraih mimpi saya. Saya memutuskan untuk mengajukan proposal beasiswa ini kepada lembaga Youth break the boundaries agar mau berkolaborasi bersama saya dalam upaya memperbaiki perekonomian di Indonesia dengan cara memberikan beasiswa kepada orang orang yang mempunyai tekad yang kuat seperti saya.',	'Saya pernah menjadi sekretaris event nasional Leadership Bootcamp yang diadakan di bandung. Sebagai sekretaris, saya bertanggung jawab atas administrasi kegiatan. Saya juga pernah menjadi ketua koordinator kegiatan audiensi pejabat kabupaten bandung barat. Saya juga banyak mengikuti pelatihan seperti pelatihan leadership, pelatihan public speaking, dan pelatihan project management',	1,	1655733273,	NULL,	0),
('SCHLR-DRLHR-dd79ff',	'USR-DRLHR-bed9e',	'Dara Aulia Herman',	'2000-09-28',	'85921374959',	'Kp. Rawa Sentul, Ds. Jayamukti, Kec. Cikarang Pusat, Kab. Bekasi',	'Bachelor of Elementary Educati',	'Albukhary International Univer',	'3.80',	'2',	'Saya adalah seorang mahasiswi yang sedang berkuliah di Malaysia mengambil jurusan Bachelor of Elementary Education. Alasan saya memilih jurusan ini karena memiliki minat sangat tinggi di bidang pendidikan, terutama kurikulum dan teknologi pendidikan. Saya juga mempunyai mimpi untuk membangun dan meningkatkan kualitas pendidikan di Indonesia menjadi lebih baik. Saat ini, saya memiliki beberapa aktivitas yang sedang dijalani dengan tujuan untuk terus mengembangkan diri, seperti berorganisasi di PPI AIU dan mengikuti kerelawanan di Latmtk dan Edu-Circle. Di PPI-AIU, saya mendapat amanah di Departemen Pendidikan dan Kebudayaan yang mempunyai program penyaluran minat dan bakat dalam bidang pendidikan dan budaya. Salah satu program yang saya ampu yaitu PPI-AIU Mengajar dimana program ini menjadi wadah bagi para mahasiswa Indonesia yang ingin terjun kelapangan mengajar dan membagikan ilmu serta pengalaman mereka. Selanjutnya, pada kegiatan volunteering yang saya lakukan di Latmtk, Divisi Kurikulum merupakan tempat saya dapat mengembangkan minat, bakat, dan skill saya sehingga dapat diasah lebih baik lagi. Selain itu, saya juga ditunjuk sebagai delegasi oleh PPI-AIU untuk mengikuti kegiatan Edu-Circle yang merupakan salah satu program dari PPI Malaysia. Platform ini digunakan oleh kami mahasiswa yang berkuliah di Malaysia untuk dapat membagikan informasi dan pengalaman mengenai pendidikan yang akan disebar untuk para calon mahasiswa yang akan berkuliah di Malaysia.',	'Salah satu mimpi terbesar saya sejak kecil adalah dapat menempuh pendidikan di luar negeri. Sifat ingin tahu banyak hal dan motivasi belajar yang tinggi menjadi bahan bakar semangat pantang menyerah menggapai mimpi saya. Selain itu, keinginan ini semakin kuat ketika saya menginjak bangku sekolah menengah pertama karena saya berada di lingkungan yang tidak mendukung, seperti fasilitas yang tidak memadai, sikap tak acuh para guru dalam melaksanakan kewajibannya, dan sebagainya. Langkah awal yang saya tempuh untuk mewujudkan mimpi saya adalah mencari sekolah menengah atas yang dapat mendukung dan menunjang aktivitas pendidikan saya. Saya juga melakukan riset tentang minat dan bakat saya agar dapat memilih dan menentukan jurusan lebih mudah. Setelah langkah-langkah ini selesai dengan sempurna, saya mencari beasiswa sarjana pendidikan dan merangkumnya. Saya juga sering mengikuti kegiatan education fair seperti dari UK, USA, Australia, Jepang, dan sebagainya untuk menambah dan memvalidasi informasi yang telah saya dapatkan. Semua langkah-langkah ini akan terasa sia-sia jika nilai akademik saya tidak memenuhi kriteria persyaratan sehingga saya tidak lupa untuk belajar dengan sangat giat dan juga berdoa pada Tuhan YME untuk diberikan kelancaran dalam setiap proses. Alhamdulillah, perjalanan ini tidak sia-sia dan salah satu mimpi terbesar saya tercapai pada tahun 2020 ketika dinyatakan diterima sebagai mahasiswi di Albukhary International University. ',	'Saya telah mengikuti beberapa kegiatan organisasi dan relawan sejak saya duduk dibangku sekolah menengah pertama hingga saat ini. Ada beberapa kesempatan yang sangat menginspirasi dan membawa perubahan di dalam kehidupan saya. Kesempatan pertama yaitu ketika saya mengikuti kegiatan non-formal pendidikan di daerah saya dan diangkat sebagai bendahara dan divisi kurikulum. Generasi  Unggulan merupakan nama kegiatan yang saya jalani dimana para generasi penerus bangsa belajar ilmu agama secara mendalam. Saya yang mendapat amanah menjadi seorang bendahara memiliki tanggung jawab dengan alur kas masuk dan keluar. Selain itu, kami membuka warung jajanan yang dapat dibeli oleh para peserta generasi unggulan selama kegiatan belajar ini. Tujuannya adalah untuk mengembangkan uang kas agar lebih bermanfaat untuk kedepannya. Dari pengelolaan uang ini, kami para peserta dan pengurus bisa berlibur ke beberapa daerah seperti Jungleland Bogor dan wisata ke Malang seperti pantai Tiga Warna, Jatim Park, dan Paralayang. Lebih lanjut, sebagai divisi kurikulum saya dan rekan-rekan membuat RPP dan melakukan evaluasi di setiap minggunya. Setelah selesai menjabat dua kewajiban, saya mendapat amanah lagi di organisasi Persatuan Pelajar Indonesia dalam Departemen Pendidikan dan Kebudayaan. Di masa kepengurusan ini, banyak pengalaman telah saya dapatkan seperti menjadi panitia acara mengundang teman-teman dari berbagai negeri dengan kultur berbeda, teman-teman PPI yang berada di universitas berbeda, serta para petinggi KJRI yang telah merawat kami seperti anak sendiri. Saya juga mendapat tanggung jawab untuk menyusun program PPI-AIU Mengajar yaitu kegiatan sukarela untuk mengajar anak-anak di Malaysia bagi para warga PPI yang berminat. Selain dapat mengimplementasikan ilmu yang telah dipelajari selama kuliah, mengadakan kegiatan ini juga melatih dan mengembangkan skill para relawan seperti skill mengajar, komunikasi, dan penyusunan bahan materi ajar dengan sistematis. Adik-adik yang kami ajari pun merasa sangat senang dan bahagia dengan kedatangan kami karena membawakan kegiatan dan materi yang tidak membosankan (menggunakan hands-on lesson plan). ',	1,	1655705647,	NULL,	0),
('SCHLR-DSDWH-1605c7',	'USR-DSDWH-2517e',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655710288,	NULL,	0),
('SCHLR-DSMNH-61088a',	'USR-DSMNH-9a020',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655738313,	NULL,	0),
('SCHLR-DSMNH-95e6f1',	'USR-DSMNH-4f3c7',	'Desman Hura',	'2001-12-06',	'82367157880',	'Jalan Harmonika No.88A, Titi Rantai, Kecamatan Medan Baru, Kota Medan',	'Psikologi',	'Universitas Sumatera Utara',	'3.88',	'2',	'Nama saya Desman Hura. Saya merupakan anak ke empat dari delapan bersaudara. Saya tinggal di salah satu desa di Kabupaten Nias yang tahun 2019 lalu baru saja dimasuki PLN. Ayah saya meninggal 6 tahun yang lalu, sebelumnya beliau bekerja sebagai petani. Sekarang ibu saya bekerja seorang diri untuk memenuhi kebutuhan kami anak-anaknya dari hasil bekerja sebagai petani juga. Dapat berkuliah di salah satu PTN terbaik di Indonesia merupakan berkat terbesar bagi saya. Walaupun saya harus menunda perkuliahan saya setahun karena keterbatasan finansial, apalagi tahun 2020 dampak ekonomi akibat covid 19 sangat besar. Dalam proses perkuliahan di USU saat ini, sering sekali saya mengalami kendala dalam hal pembiayaan kuliah karena saya merupakan mahasiswa regular dan tidak ada dukungan beasiswa. Tidak jarang ibu saya harus meminjam ke pada tetangga untuk membiayai biaya kuliah dan biaya hidup saya yang sekarang tinggal di kost dekat kampus. Untuk itu, dukungan finansial sangat saya butuhkan supaya perkuliahan saya dapat lancar tanpa kendala sampai lulus.\r\n\r\nSaya merupakan salah seorang yang sangat tertarik pada aksi sosial, terlebih pada aksi yang dapat membantu dan memberikan manfaat bagi orang lain. Hal ini berasal dari ajaran orang tua saya yang mengarahkan saya untuk tetap menjadi berkat bagi orang lain, tanpa harus dihalangi oleh keterbatasan yang ada. Pada masa perkuliahan sekarang, saya bergabung dengan organisasi Generasi Muda Nias yang merupakan sebuah organisasi kepemudaan yang bergerak dibidang pendidikan dan sosial, khususnya di kepulauan Nias. Melalui organisasi tersebut, kami melakukan banyak project sosial seperti menggalang donasi pada korban bencana atau pihak yang membutuhkan di Nias. Program yang sedang kami lakukan sekarang  adalah memberikan wadah dan tempat bagi adik-adik dari kepulauan Nias yang ingin mencoba SBMPTN di Medan, tetapi terkendala tempat tinggal dan akomodasi lainnya. Ketertarikan pada isu sosial juga yang mengantarkan saya untuk memutuskan  menekuni ilmu psikologi. Hal ini berawal dari pengamatan saya di lingkungan sosial tempat saya tinggal. Banyak orang dengan gangguan mental skizofrenia yang diperlakukan secara tidak manusiawi oleh lingkungan. Mereka dilempari batu, dilecehkan, dijauhi dan sering disebut orang kerasukan setan. Padahal kalau boleh memilih, orang-orang dengan gangguan tersebut tidak ingin memilki kondisi seperti itu. Banyak juga anak-anak dengan keadaan disabilitas menjadi bahan bulian teman-temannya karena keterbatasan yang mereka miliki. Saya ingin sekali suatu hari menjadi seorang psikolog klinis yang dapat membuatkan rumah rehabilitasi pada orang-orang dengan gangguan skizofrenia dan membantu membenahi perspektif masyarakat tentang kesehatan mental.\r\nSebagai seorang mahasiswa, saya mencoba untuk mengasah kemampuan soft skill dan hard skill saya. Di organisasi Generasi Muda Nias, saya mengemban tanggung jawab sebagai sekretaris satu yang bertugas mengurus segala keperluan administrasi dalam organisasi bersama sekretaris umum. Saya juga terus mengasah jiwa kepemimpinan saya melalui berbagai kepanitiaan dan organisasi lainnya.   Selain itu, saya juga tidak berhenti untuk mengikuti berbagai perlombaan nasional khusunya dalam penulisan karya ilmiah. Meskipun belum pernah menjuarai lomba sampai saat ini, saya yakin proses belajar dan pengalaman yang banyak akan membuahkan hasil yang baik suatu hari.\r\n',	'Mimpi terbesar saya adalah berkuliah di luar negeri dengan beasiswa. Hal tersebut sejalan dengan cita-cita saya untuk menjadi psikolog klinis. Saya sangat ingin megambil S2 profesi psikolog saya di luar negeri. Negara yang menjadi impian saya untuk melanjutkan studi adalah Amerika dan Kanada. Untuk itu, pada masa kuliah sekarang, saya berusaha dengan maksimal untuk mengumpulkan portofolio yang banyak melalui organisasi, perlombaan dan project sosial sebagai pendukung saya mendapatkan beasiswa setelah lulus dan sebagai syarat juga untuk mendapatkan LoA dari kampus luar negeri. Selain itu, saya juga memperkuat kemampaun bahasa Inggris saya dengan belajar melalui buku dan berbagai platform online lainnya. Yang paling penting di atas semuanya adalah berdoa kepada Tuhan supaya diberi kemudahan atas mimpi-mimpi saya.',	'Saya senang mengikuti kegiatan organisasi dan relawan sejak duduk di bangku SMA. Di SMA saya dipercayakan menjadi koordinator seksi bidang komunikasi bahasa Inggris di OSIS SMAN Unggulan Sukma Nias (2018-2019). Sebagai koordinator, tugas saya adalah merancang dan menjalankan program kerja terkait bidang saya. Setiap event tertentu, maka saya dan tim saya akan mengkoordinir kegiatan baik lomba atau sejenisnya yang berhubungan dengan bidang komunikasi Bahasa Inggris. \r\n\r\nPada tahun 2021, saya menjadi Campus Ambassador di International Model United Nations. Tugas saya adalah meyebarkan informasi terkait konferensi yang diadakan oleh IMUN dan membantu merekrut peserta konferensi. Selain itu, saya juga pernah menjadi Ambassador Campaign di  Quarter Life Project. Saya diberi tanggung jawab menyebarkan informasi terkait project yang sedang dilaksanakan, khusunya pada bidang kesehatan mental. Masih berhubungan dengan kesehatan mental, saya juga pernah menjadi volunter di Kita Korban Bullying. Saya bertugas menyebarkan informasi tentang bullying dan membuat konten tentang bullying di instagram.\r\n\r\nSaat ini, saya juga bergabung di organisasi Generasi Muda Nias yang merupakan sebuah organisasi yang fokus pada pendidikan dan sosial di Kepulauan Nias. Kepulauan Nias sendiri terdiri dari 4 kabupaten dan 1 kota. Saya dipercayakan menjadi sekretaris satu untuk periode 2021-2023. Bersama sekretaris umum, saya bertugas mengarsip dan mengelola segala urusan administrasi organisasi. Sebelum menjadi BPH, saya juga sempat menjadi sekretaris panitia pada kegiatan Family Gathering Generasi Muda Nias 2021. Di organisasi ini, saya sering menjadi relawan untuk beberapa aksi sosial seperti memberi makan kota dan penggalangan dana untuk donasi. \r\n\r\nDi kampus, saya juga pernah menjadi relawan pada kegiatan pengabdian masyarakat PEMA Fakultas Psikologi USU 2022. Saat itu, kami pergi ke rumah singgah bagi anak-anak penderita kanker dan menyelenggarakan kegiatan di sana.\r\n\r\n',	1,	1655740846,	NULL,	0),
('SCHLR-DTFHR-a58906',	'USR-DTFHR-51606',	'Dita Fahira',	'2002-05-08',	'85157421335',	'Jl. Hos Cokroaminoto, Kec. Banding Agung, Kab. OKU Selatan, Prov. Sumatera Selatan ',	'Kedokteran ',	'Universitas Bengkulu ',	'3.79',	'2',	'Nama saya Dita Fahira. Saat ini umur saya 20 tahun . Saya berasal dari OKU Selatan, Sumatera Selatan. Saya merupakan mahasiswa program studi kedokteran di Universitas Bengkulu. Saya telah hidup jauh dari orang tua sejak di bangku SMA, sehingga sikap mandiri, disiplin, dan bertanggung jawab telah terbentuk dalam diri saya. Sejak SD saya telah mengikuti berbagai ekskul dan olimpiade. Saat ini saya tergabung di dalam organisasi TBM (Tenaga Bantuan Medis) dan Pengurus ISMKI (Ikatan Senat Mahasiswa Kedokteran Indonesia)',	'Mimpi terbesar saya adalah dapat bermanfaat bagi banyak orang dan membanggakan kedua orang tua saya. Mimpi tersebut lah yang memotivasi saya untuk menjadi dokter yang bermanfaat bagi orang lain dan dapat meningkatkan tingkat kesehatan masyarakat, terutama di daerah terpencil . Untuk mulai merealisasikan tujuan saya, saya mendaftarkan diri sebagai volunteer. Saya yakin dengan menjadi volunteer, saya dapat memberikan dampak positif bagi daerah saya kunjungi dengan pengetahuan dan kemampuan saya. ',	'Sejak SD saya telah aktif mengikuti berbagai ekskul dan organisasi. Saya pernah menjabat sebagai anggota osis dan ketua PMR. sekarang saya sedang aktif di organisasi TBM (tenaga bantuan medis) dan pengurus ISMKI (Ikatan Senat Mahasiswa Kedokteran Indonesia). Selain organisasi, saya juga pernah menjadi relawan pengajar di panti asuhan dan sekarang saya sedang menjalani seleksi relawan tenaga kesehatan di NTT.',	1,	1655127298,	NULL,	0),
('SCHLR-DTPRM-f44b16',	'USR-DTPRM-6595f',	'Dita Permatasari Sitohang',	'2003-05-25',	'82267532470',	'Jl. Kancil No.14, Kab. Labuhanbatu, Kec. Rantau Selatan, Prov. Sumatera Utara',	'Pendidikan Pancasila dan Kewar',	'Universitas Negeri Padang',	'3.66',	'2',	'Assalamualaikum, dan selamat siang bapak/ ibu dari panitia yang mengadakan  beasiswa pemuda ini. Sebelumnya  izinkan saya memperkenalkan  diri :\r\nNama       : Dita permatasari Sitohang\r\nAsal          : PROV Sumatra Utara, JL. Kancil No. 14\r\nPekerjaan : Mahasiswa Universitas negeri Padang\r\nKelebihan :  Menguasai praktek makeup, mengusai pembuatan poster digital, mampu mengaplikasikan microsoft office\r\nPrestasi    : 1) Peraih  juara favorit lomba poster dalam lomba zillenials creative events\r\n                  2) peraih medali perunggu dalam olimpiade bahasa indonesia tingkat nasional  yang di selenggarakan oleh universitas islam negeri sumatera utara\r\n                  3) peraih nilai b+ dalam kompetisi sains indonesia posi tahun 2021\r\n                  4) anggota himpunan mahasiswa jurusan ilmu sosial politik\r\n                  5 ) sebagai peserta lomba pidato yang di selenggarakan universtas negeri padang \r\n\r\nhobbi     : Badminton , renang\r\nprinsip   : kerja keras, pantang menyerah, disiplin\r\n\r\nHallo pastinya sudah tau nama saya , yah nama saya Dita Permatasari Sitohang asal dari provinsi sumatera utara yang saat ini sedang menempuh pendidikan di universitas negeri padang. Saya merupakan mahasiswa yang duduk di semester 2 jurusan pendidikan pancasila dan kewarganegaraan, saya merupakan sosok yang dapat di bilang sangat tidak kenal kata menyerah untuk mendapatkan sesuatu yang di harapkan, saya disiplin dalam mengerjakan tugas apapun itu. pastinya setiap manusia memiliki prinsip masing masing, prinsip saya yaitu pantang menyerah, disiplin, dan jangan dengarkan orang yang membuat mental kita down. jujur untuk masuk di universitas negeri padang sangat susah perjuangannya, mulai dari ikut seleksi SNMPTN, SBMPTN namun ketika saya mengikuti seleksi tersebut saya gagal, dan yah saya mengikuti selesi yang ketiga jalur mandiri dan disitulah saya dinyatakan lulus, sesuai apa yang saya katakan saya anti dengan kata menyerah. Dalam hidup harus la kerja keras untuk mendapatkan sesuatu yang kita mau.\r\n\r\nSaya mahasiswa yang sangat aktif di kampus, baik itu di dalam kelas ketika mengikuti perkuliahan dari dosen dan ketika mengikuti organisasi dari kampus, sekarang saya sedang mengikuti organisasi angkatan muda himpunan jurusan ilmu sosial politik, saya di Latih untuk dapat berbicara dan di latih untuk dapat berkontribusi ketika ada masalah.\r\n\r\nketika tidak ada kesibukan saya memanfaatkan waktu saya untuk mengikuti perlombaan perlombaan yang menguntungkan untuk saya, karena saya dapat menguasai bidang digital, saya sering mengikuti lomba poster dan dari mengikuti lomba itu saya mendapatkan juara dan hadiah. saya sangat tidak suka jika waktu habis sia saia, maka dari itu saya memanfaatkan waktu saya sebaik mungkin.\r\n\r\nSekian lah cerita tentang diri saya, saya ucapkan terimakasih :)\r\n',	'Mimpi terbesar saya dalam hidup adalah Ingin sekali bekerja sebagai  kepala dinas pendidikan di kota medan, yah pastinya  sangat tidak mudah untuk mencapainya maka dari itu saya mewujudkannya dengan harus bersungguh sungguh untuk menjalankan perkuliahan saya dan harus mencapai ipk lebih dari 3.5, dan saya pastinya harus mengikuti bimbingan digital agar mendaptkan ilmunya dan sertifikat nya sebagai penuenjang prestasi, selain itu saya harus banyak mengikuti segala jenis perlombaan karena selain mendapatkan hadiah saya juga mendapatkan sertifikat sebagai bukti bahwa saya memiliki prestasi.  kesimpulannya untuk mencapai cita cita saya , saya harus bekerja keras untuk mendapatkan hal itu dan di sertai dalam doa juga karena percuma saja ketika kita dalam proses ke atas jika tanpa doa sama saja kita sombong kepada tuhan kita, karena mau bagaiamana pun manusia hanyalah dapat berencana dan berusaha hanya tuhan lah yang menentukan  apapun itu. selain itu kita patinya juga harus minta dukungan dari oran tua kita sebagai bentuk rasa ucapan syukur bahwa kita masih di karunia orang tua yang masih sayang kepada kita',	'Saya punya pengalaman organisasi , saat ini saya menjalankan organisasi angkatan muda himpunan jurusan ilmu sosial politik di universitas negeri padang, dan juga saya pernah mengikuti relawan sebagai penggerak untuk menggerakkan masyarakat agar dapat saling menghargai sesama dan mengajak untuk tidak melakukan hubungan seksual . \r\n\r\nketika saya mengikuti organisasi himpunan mahasiswa atau mengikuti sebagai relawan,  banyak sekali pelajaran yang di dapatkan, mulai dari keterampilan berbicara di depan umum, bijak dalm mengambil keputusan, dan melatih ke displinan. Maka dari itu saya orangnya sangat suka disiplin dan dapat merangkul semua ketika ada perbedaan, nah ketika ada perbedaan dalam keputusan kami diajarkan untuk tidak menggunakan emosi yang sangat tinggi , kami di ajarkan untuk saling berpegangan dalam musyawarah sehingga dari pelaksanaan musyawarah disitulah diambil keputusan tanpa emosi melainkan dengan rasa kebersamaan. intinya banyak sekali pelajaran yang di dapatkan ',	1,	1655549959,	NULL,	0),
('SCHLR-DVDFR-7c3c34',	'USR-DVDFR-e69e0',	'David Fernando Aritonang',	'2001-03-28',	'87824727802',	'Jalan Kesatuan No. 58, Kukusan, Beji, Depok, Indonesia 16425',	'Teknik Metalurgi dan Material',	'Universitas Indonesia',	'3.85',	'4',	'Saya mahasiswa tingkat 2 program studi Teknik Metalurgi dan Material di Universitas Indonesia. Saya memiliki ketertarikan dengan lingkungan dan energi terbarukan. Saya senang mengikuti berbagai kompetisi dan mendapat lebih dari 20 kejuaraan pada kompetisi seperti essay, karya tulis ilmiah, innovation competition, dan business plan competition. Selama kurang lebih 2 tahun berkuliah, saya senang mengikuti kegiatan organisasi di kampus. Ada 4 organisasi dan 5 kepanitiaan dan beberapa kegiatan sosial yang saya ikuti dan saya senang bisa belajar hal-hal baru dan bekerja dalam sebuah tim. ',	'Berbicara tentang mimpi, saya sendiri ingin menjadi seorang CEO. Saat ini saya terpikirkan akan permasalahan sampah di Indonesia. Salah satunya sampah organik dari sisa makanan. Salah satu sumber sampah makanan selain dari rumah tangga adalah sampah dari restoran, hotel, supermarket, dan rumah makan sejenisnya. Sebenarnya, makanan ini masih bisa di makan, namun terbuang sia-sia. Saya ingin memanfaatkan ini menjadi sebuah bisnis dengan membangun platform digital yang bisa menjual makanan yang tidak habis di penghujung hari dari suatu industri makanan untuk dijual dengan harga yang lebih murah melalui aplikasi digital. Selain itu, sisa sampah makanan yang sudah tidak layak dapat dijual ke petani atau composter untuk diolah.\r\nUntuk membangun ini semua, saat ini saya sedang banyak belajar dari siapa saja yang ingin berbagi cerita mengenai waste management. Saya mengikuti banyak program yang bermanfaat yang bisa membantu saya mencapai impian saya. Belajar dari pengalaman orangtua di sekitar saya dan saya merasa perlu berkolaborasi dengan pemimpin-pemimpin muda yang memiliki minat yang sama untuk mengatasi permasalahan di Indonesia melalui YBB Foundation Scholarship. Dengan adanya program ini, saya bisa mendapatkan pembelajaran seumur hidup mengenai kepemimpinan itu sendiri. Pada kesempatan kali ini juga saya belajar dengan mentor-mentor yang memiliki visi yang sama dengan saya untuk mengatasi permasalahan di Indonesia dan mendapatkan gambaran career path melalui exclusive career mentoring. Disini juga, saya berharap bisa membangun relasi dan berkolaborasi dengan teman-teman awardee untuk membangun dan memimpin Indonesia yang lebih maju.',	'Saya mengikuti beberapa organisasi di kampus seperti IMMt FTUI, Club Nanoteknologi, Green Polymer Technology, dan SPE UI. Selain itu saya juga aktif berkegiatan di luar kampus seperti tergabung dalam Duta Nasional Mahasiswa Inspiratif dan Novo Club. Pengalaman yang paling berkesan bagi saya adalah ketika kami melakukan kegiatan yang melibatkan masyarakat. Salah satunya ketika kami berkunjung ke Yayasan Nurul Barkah di Jagakarsa. Di sana kami bersama adik-adik yang ada di Yayasan Nurul Barkah belajar tentang waste management dan menanam pohon bersama. Saya merasa ketika kita bisa bermanfaat bagi orang lain di sekitar kita adalah suatu pengalaman yang tak ternilai.',	1,	1655736105,	NULL,	0),
('SCHLR-DVDNL-d05617',	'USR-DVDNL-d3847',	'Devi Dina Luthfiyanti',	'2002-10-22',	'83840046627',	'Bumi arumsari, jalan pinus VII, no. 190, RT003 RW010, Desa Cirebon Girang, Kec. Talun, Kab. Cirebon, Jawa Barat, 45171',	'Informasi dan Hubungan Masyara',	'Universitas Diponegoro',	'3.81',	'2',	'Nama saya Devi Dina Luthfiyanti, saya lahir di Cirebon 22 Oktober 2002. Saya merupakan anak pertama dari 4 bersaudara. Saat ini saya berkuliah di Universitas Diponegoro jurusan Informasi dan Hubungan Masayarakat dari fakultas sekolah vokasi angkatan 2021. Saya memiliki pribadi yang mudah bergaul, berambisi kuat, percaya diri, pekerja keras, bertanggung jawab, jujur dan kritis. Saya sangat menyukai hal baru dan tantangan baru karena bagi saya hal baru merupakan sesuatu yang belum saya pelajari atau saya alami, yang mana karakter dan pemikiran seseorang terbentuk bukanlah dimana dan bagaimana seseorang itu berada melainkan dalam dirinya yang ingin belajar dan mengembangkan sesuatu yang baru. Saya juga sangat menyukai bersosialisasi dan berkomunkasi dengan banyak orang karena setiap orang memiliki jalan pikiran dan perspektif yang berbeda-beda maka dari itu hal itulah yang selalu membuat saya tertarik untuk berkomunikasi dan bersosialisasi dengan banyak orang.',	'Mimpi terbesar saya adalah bisa membuka usaha dan membuka lapangan pekerjaan seluas-luasnya untuk dapat membantu perekonomiaan Indonesia dan rakayat kecil. Cara yangdapat saya lakukan adalah mencari tahu problem yang menjadi dasar kebutuhan masyarakat pada saat ini dimana suatu usha jika dipasarkan dengan tidak sesuai kebutuhan pasar masyarakat itu sama saja bohong karena seorang pengusaha pastilah menjual barang atau jasa yangdapat berguna dan bermanfaat bagi masyarakat. Selain mencari problem, hal yang ingin diperjualkan dan target pasar ialah mencari relasi, yang mana saat ini saya sedang menempuh bangku kuliah dan untuk mendapatkan relasi begitu besar peluang nya yaitu saya mengikuti organisasi-organisasi yang relevant dengan dunia wirausaha yaitu saat ini saya menjadi anggota BEM undip bidang Ekonomi Kreatif dananggota Hipmi PT Undip atau Himpunan pengusaha Muda Universitas Dponegoro.',	'Iya saya mempunyai pengalaman organisasi yang sangat relevant dan sejalan dengan mimpi saya menjadi seorang pengusaha yaitu menjadi staff muda dari Badan Eksekutif Mahasiswa (BEM) Undip bidang Ekonomi Kreatif dimana saat ini saya diamanahkan menjadi bagian dari divisi EDC dalam Ekotif BEM Undip yaitu Entrepeneur Development Centre yang mana saya sebagai wadah bagi seluruh mahasiswa Universitas Diponegoro untuk mengembangkan usaha nya, selain menjadi anggota staff muda dari Ekotif BEM Undip saya juga menjadi bagian dari anggota HIPMI PT Undip atau Himpunan Pengusaha Muda Universitas Diponegoro,dalam HIPMI PT Undip saya diamanahkan menjadi bagian dari divisi bisnis kreatif.',	1,	1654428377,	NULL,	0),
('SCHLR-DVDYS-ea3e78',	'USR-DVDYS-51ba3',	'David Yosafat Yoel',	'2002-11-26',	'82264360494',	'Mredo, Bangunharjo, Kec. Sewon, Kab. Bantul, Yogyakarta, 55188',	'Film dan Televisi',	'ISI Yogyakarta',	'3.52',	'2',	'Saya adalah pribadi yang aktif dalam kegiatan sekolah dan kegiatan sosial. Kreatif serta memberi ide pada organisasi yang saya ikuti. Mahasiswa semester dua yang selalu mengejar nilai bagus dan prestasi non akademik.',	'Menjadi filmmaker ternama di Indonesia. Menghasilkan karya terbaik untuk negeri.',	'Di bangku SMP dan SMA saya selalu terlibat keorganisasian dan masih saya teruskan sampai menjadi mahasiswa menjadi bagian dari organisasi kemahasiswaan dan BEM Fakultas.',	1,	1653555754,	NULL,	0),
('SCHLR-DVNNR-a84b30',	'USR-DVNNR-df8ae',	'Deviana Nur Azizah',	'2001-06-20',	'82261348767',	'Kampung Tajur Jalan H. Bacek No. 14 RT 001/002 Kel. Tajur, Kec. Ciledug, Kota Tangerang, Banten',	'Ilmu Pemerintahan',	'Universitas Padjadjaran',	'3.95',	'4',	'I am a Government Science student at Universitas Padjadjaran that has intellectual curiosity, a highly professional attitude, a strong determination to perform great work, and am a communicative also fast-learner person. I am currently looking for a challenging internship and organization to improve my work skills as a part of the team and make a real impact through my contributions. Fields of interest such as Human Resources, Public Relations, Partnership, and Project or Event Planner.',	'Untuk jangka pendek, mimpi terbesar saya adalah lulus S1 dengan tepat waktu. Alasannya adalah karena ingin meringankan beban orangtua dalam hal biaya pendidikan. Namun sebelum itu, saya sudah harus memastikan bahwa saya memiliki cukup bekal untuk terjun ke kehidupan pasca kampus. Bekal ini bisa diperoleh melalui kegiatan organisasi, kepanitiaan, dan magang yang saya geluti selama masa perkuliahan. Untuk mewujudkan mimpi saya, saya merasa sudah satu langkah di depan teman-teman saya karena saya beberapa kali sudah berdiskusi dengan dosen terkait topik-topik skripsi yang akan saya ambil.\r\n\r\nSedangkan untuk mimpi jangka panjang termasuk dalam kehidupan pasca kampus, saya berkeinginan untuk bekerja terlebih dahulu di salah satu instansi pemerintahan. Alasannya adalah ketika menjalani perkuliahan seringkali saya dihadapkan bahwa permasalahan di dunia pemerintahan itu semakin kompleks dan cukup banyak, khususnya pelayanan publik. Dengan saya terjun dan masuk ke lingkungan pemerintahan, saya berkeinginan untuk merubah dan membuat terobosan-terobosan baru sehingga dapat bermanfaat untuk masyarakat. Setelah mendapat pengalaman di dunia kerja, saya juga berkeinginan untuk melanjutkan studi S2, baik di dalam maupun luar negeri, dengan beasiswa, semisal LPDP. Saat ini, saya sering membaca buku, mengikuti webinar, dan course Bahasa Inggris untuk membantu saya meningkatkan kemampuan dan kapabilitas yang saya miliki, sehingga saya bisa dapat mempersiapkannya dari awal.',	'Semasa sekolah hingga masuk universitas, saya ikut terlibat aktif dalam berbagai organisasi, kepanitiaan, dan aktivitas relawan. Saat di SMA saya menjabat sebagai Sekretaris di CIVIC; sebuah unit ekstrakurikuler siswa yang berfokus pada bidang Debat dan Cerdas Cermat 4 Pilar Kebangsaan. Setelah lulus, saya terlebih dahulu menempuh pendidikan S1 di Universitas Negeri Jakarta di mana saya turut itu dalam kepanitiaan MP EXPO sebagai staf Divisi Dana Usaha dan Sponsorship serta staf Biro Keuangan di Hima MP. Namun, setahun kemudian saya melanjutkan pendidikan di Universitas Padjadjaran. Dari sini, saya pun ikut terlibat aktif, seperti di awal semester saya magang di BEM FISIP sebagai staf Hubungan Masyarakat hingga memperoleh predikat \"Best Intern\". Dilanjutkan pada tahun berikutnya, saya mengikuti BEM FISIP, Hima IP, Unpad Awards, Prototipe, dan sebagainya. Sebagian besar bidang yang saya geluti berada di Hubungan Masyarakat.',	1,	1655744023,	NULL,	0),
('SCHLR-DVNSF-98dac5',	'USR-DVNSF-cf99b',	'Diva Nisfu Mustika',	'2003-04-08',	'89649154770',	'Jl.Kwagean Cokrah, Kec. Wonopringgo, Kab. Pekalongan, Jawa Tengah 51181',	'Statistika dan Sains Data/FMIP',	'IPB University',	'4.00',	'2',	'Saya adalah mahasiswa tingkat pertama IPB University . Saya memiliki hobi belajar dan merangkum materi pelajaran. Minat saya mengenai data menjadikan saya memilih jurusan Statistika dan Sains Data sebagai pilihan jurusan yang saya tempuh dan berharap kelak bisa menjadi seorang Data Scientist mengingat bidang ini banyak dibutuhkan di masa depan. Saya memiliki kepribadian ambisius dalam mencapai target, tidak mudah putus asa, senang belajar dan mencoba hal baru, disiplin, dan juga mudah beradaptasi. Dengan sifat dan karakter saya, saya ingin memanfaatkanya serta mengembangkan dan mengeksplorasi diri supaya menjadi lebih baik. ',	'Mimpi terbesar saya bisa mewujudkan kenginan orang tua saya yaitu melanjutkan studi di luar negeri dan mendapatkan pekerjaan sesuai dengan passion saya. Saya berusaha mencapai target tersebut dengan belajar dan mempersiapkan hal-hal untuk bisa mendapatkan salah satu beasiswa S2 di luar negeri. Saya juga berusaha menambah pengalaman saya di berbagai kegiatan kampus maupun luar kampus dengan harap bisa menjadi bekal ketika terjun di dunia yang lebih profesional lagi. ',	'Pernah, dalam kegiatan kampus saya mengikuti UKM tutor sebaya yang berfokus pada hal akademik, seperti mengadakan kelas tutor, try out persiapan uts maupun uas, dan memberikan rangkuman mata kuliah kepada teman-teman mahasiswa tingkat 1. Selain itu, saya juga tergabung dalam The Doctor IPB dalam divisi Internal. Beberapa proker yang sudah kami laksanakan seperti mengadakan acara Dormitori Contest menganai perlombaan yang  bisa diikuti oleh mahasiswa IPB tingkat pertama, webinar-webinar, dan kegiatan lainnya. Selain dalam kampus, di luar kampun pun saya aktif mengikuti kegiatan volunteer komunitas online seperti Gerakan Suka Baca, Rumah Sandar, House Ilmu, GRIPA Indonesia, Kmai Kreator, dll yang sebagian berfokus pada hal peneidikan. Saya bisa mendapatkan banyak ilmu dan pengalaman melalui kegiatan-kegiatan tersebut. ',	1,	1655740568,	NULL,	0),
('SCHLR-DVNYL-4bd7d2',	'USR-DVNYL-088b7',	'DEVI NAYLA SALSABILA',	'2004-06-05',	'85746128183',	'Jl. Makam Dusun Kauman RT.002 RW.002 Puger Kulon Kecamatan Puger  , KAB. JEMBER, PUGER, JAWA TIMUR, ID, 68164',	'Promosi Kesehatan',	'Politeknik Negeri Jember',	'0.00',	'Mahasiswa ',	'Saya merupakan individu yang memiliki antusias dan motivasi tinggi. Terampil dalam mengoperasikan software desain seperti Corel Draw, Canva, Adobe Photoshop dsb. Saya senang belajar hal baru dan memiliki komunikasi yang baik.',	'Mimpi terbesar saya yaitu menjadi INSPIRASI bagi orang lain, bisa bermanfaat bagi orang lain. Tentunya cara saya untuk mewujudkan mimpi saya yaitu dengan mendapatkan beasiswa ybb 2022, menjadikan diri saya berkualitas. Dengan bantuan Beasiswa YBB 2022 ini saya ingin  menjadi sosok inspiratif di generasi muda.',	'Waktu SMK saya pernah mengikuti magang di sekolah, dimana hal tersebut diajarkan hal terdasar menjadi seorang yang mempunyai tanggung jawab akan hal yang sudah dilakukan, belajar dengan giat seperti mempelajari Corel draw, Adobe Photoshop, dsb, bisa bermanfaat bagi orang lain seperti: membantu foto copy, mendesign dan menjualnya dan juga saya pernah mengikuti ekskul paduan suara',	1,	1653634437,	NULL,	0),
('SCHLR-DVNYL-570e78',	'USR-DVNYL-088b7',	'DEVI NAYLA SALSABILA',	'2004-06-05',	'85746128183',	'Jl. Makam Dusun Kauman RT.002 RW.002 Puger Kulon Kecamatan Puger  , KAB. JEMBER, PUGER, JAWA TIMUR, ID, 68164',	'Promosi kesehatan',	'Politeknik Negeri Jember',	'0.00',	'Mahasiswa ',	'Saya merupakan individu yang memiliki antusias dan motivasi tinggi. Terampil dalam mengoperasikan software desain seperti Corel Draw, Canva, Adobe Photoshop dsb. Saya senang belajar hal baru dan memiliki komunikasi yang baik.',	'Mimpi terbesar saya yaitu menjadi INSPIRASI bagi orang lain, bisa bermanfaat bagi orang lain. Tentunya cara saya untuk mewujudkan mimpi saya yaitu dengan mendapatkan beasiswa ybb 2022, menjadikan diri saya berkualitas dengan bantuan Beasiswa YBB 2022 ini saya ingin  menjadi sosok inspiratif di generasi muda.',	'Waktu SMK saya pernah magang di sekolah, dasar terpenting yang saya pelajari dari hal tersebut yaitu menjadi seorang yang bertanggung jawab akan hal yang sudah saya lakukan, belajar kedisiplinan. Belajar mendesign bersama banyak orang-orang dan juga masih banyak hal lainnya ketika saya mengikuti LOMBA LKS tingkat JATIM, saya juga pernah ikut ekskul paduan suara di sekolah',	1,	1653633423,	NULL,	0),
('SCHLR-DVNYL-ade157',	'USR-DVNYL-088b7',	'DEVI NAYLA SALSABILA',	'2004-06-05',	'85746128183',	'Jl. Makam Dusun Kauman RT.002 RW.002 Puger Kulon Kecamatan Puger  , KAB. JEMBER, PUGER, JAWA TIMUR, ID, 68164',	'Promosi Kesehatan',	'Politeknik Negeri Jember',	'0.00',	'Mahasiswa ',	'Saya merupakan individu yang memiliki antusias dan motivasi tinggi. Terampil dalam mengoperasikan software desain seperti Corel Draw, Canva, Adobe Photoshop dsb. Saya senang belajar hal baru dan memiliki komunikasi yang baik.',	'Mimpi terbesar saya yaitu menjadi INSPIRASI bagi orang lain, bisa bermanfaat bagi orang lain. Tentunya cara saya untuk mewujudkan mimpi saya yaitu dengan mendapatkan beasiswa ybb 2022, menjadikan diri saya berkualitas dengan bantuan Beasiswa YBB 2022 ini saya ingin  menjadi sosok inspiratif di generasi muda.',	'Waktu SMK saya pernah mengikuti magang di sekolah dimana hal tersebut diajarkan bertanggung jawab akan hal yang sudah saya lakukan, belajar dengan tekun seperti mengoding, Corel draw, Adobe Photoshop dsb, dimana saya selalu menerapkan kedisiplinan pada setiap hal yang saya lakukan, saya juga pernah mengikuti ekskul paduan suara di sekolah ',	1,	1653633935,	NULL,	0),
('SCHLR-DVNYL-c54080',	'USR-DVNYL-088b7',	'DEVI NAYLA SALSABILA',	'2004-06-05',	'85746128183',	'Jl. Makam Dusun Kauman RT.002 RW.002 Puger Kulon Kecamatan Puger  , KAB. JEMBER, PUGER, JAWA TIMUR, ID, 68164',	'Promosi Kesehatan',	'Politeknik Negeri Jember',	'0.00',	'Mahasiswab',	'Saya merupakan individu yang memiliki antusias dan motivasi tinggi. Terampil dalam mengoperasikan software desain seperti Corel Draw, Canva, Adobe Photoshop dsb. Saya senang belajar hal baru dan memiliki komunikasi yang baik.',	'Mimpi terbesar saya yaitu menjadi INSPIRASI bagi orang lain, bisa bermanfaat bagi orang lain. Tentunya cara saya untuk mewujudkan mimpi saya yaitu dengan mendapatkan beasiswa ybb 2022, menjadikan diri saya berkualitas dengan bantuan Beasiswa YBB 2022 ini saya ingin  menjadi sosok inspiratif di generasi muda.',	'Waktu SMK saya pernah magang di sekolah, dasar terpenting yang saya pelajari dari hal tersebut yaitu menjadi seorang yang bertanggung jawab akan hal yang sudah saya lakukan, belajar kedisiplinan. Belajar mendesign bersama banyak orang-orang dan juga masih banyak hal lainnya ketika saya mengikuti LOMBA LKS tingkat JATIM, saya juga pernah ikut ekskul paduan suara di sekolah',	1,	1653634773,	NULL,	0),
('SCHLR-DVNYN-e91c0d',	'USR-DVNYN-ceecc',	'Divanya Nouval I.S',	'2002-12-28',	'87873771763',	'Bukit Permata Sari Jl. Mutiara A4/32, Bogor',	'Teknik Industri',	'Institut Teknologi Bandung',	'3.01',	'2',	'Nama saya Divanya Nouval Irnadianis Sulaeman dan saya berumur 19 tahun. Sekarang saya sedang menempuh pendidikan di Institut Teknologi Bandung dengan jurusan Teknik Industri. Saya merupakan tipe orang yang menghargai pendapat orang lain tapi juga tidak ragu untuk menyuarakan pendapat saya walaupun bertolak belakang dengan pendapat orang lain. Saya terbuka untuk saling berargumen tentang pendapat satu sama lain karena saya dapat menerima kritikan dengan tujuan untuk menjadi lebih baik lagi. Saya juga termasuk orang yang introvert yaitu dapat menyimpan energi lebih banyak apabila sendiri tapi saya tidak keberatan dan mudah bekerja sama dalam tim maupun individual. Hal itu dikarenakan saya menyadari porsi saya saat bersama orang lain ataupun sendiri. Saya selalu percaya akan kemampuan diri yang saya miliki. Saya akan terus mencoba meningkatkan kemampuan diri saya untuk terus lebih baik agar kepercayaan diri saya tidak menurun. Saya lebih memilih untuk berusaha menjadi lebih baik lagi daripada mendramatisasi  kekurangan saya. Saya senang sekali mempelajari hal baru yang belum pernah saya lakukan sebelumnya.\r\n	\r\nNamun, saya menyadari bahwa saya kurang peka pada suatu keadaan. Oleh karena itu saya mencoba untuk selalu memperhatikan bagaimana orang lain berkomunikasi serta atmosfer pada saat itu untuk mengetahui keadaan yang terjadi lingkungan tsb. Saya termasuk orang yang butuh  waktu untuk bersosialisasi. Oleh karena itu saya berpartisipasi dalam banyak kegiatan untuk terus membaur dengan lingkungan agar saya terbiasa untuk beradaptasi dengan mudah. Terkadang  saya tergesa gesa dalam melakukan sesuatu. Walaupun tergesa gesa, saya tetap mecoba detail pada apa yang saya kerjakan sehingga tetap dapat memberikan hasil yang baik dan memuaskan.',	'Saya memiliki mimpi untuk mendirikan sebuah start up yang berfokus pada bidang sosial. Alasan saya ingin berfokus pada permasalahan sosial karena seperti yang bisa kita lihat sekarang, banyak sekali permasalahan yang disebabkan oleh etika masyarakat itu sendiri. Oleh karena itu, saya ingin memperbaiki keadaan tersebut melalui start up yang saya rancang. Salah satu hal yang saya lakukan dari sekarang adalah melakukan riset terhadap masyarakat untuk mengetahui latar belakang dari segala perbuatan dan kejadian yang terjadi dalam lingkungan kita. Sehingga nantinya saya bisa membantu untuk mengurangi hal yang negatif dan mengembangkan hal positif dari masyarakat melalui start up tersebut. Saya juga ingin menciptakan sekolah di daerah terpencil untuk membantu anak-anak yang tertinggal di sana. Dalam sekolah tersebut, kita mengajarkan hal-hal umum seperti membaca, menghitung, konseling, dan lain lain. Saya ingin melakukan hal tersebut karena saya mau melaksanakan tanggung jawab saya sebagai makhluk sosial yaitu membantu orang lain.',	'Pada saat SMA, saya pernah bergabung dengan OSIS selama 2 periode. Pada periode pertama saya menjabat sebagai english socialization dan pada periode kedua saya menjabat sebagai kepala bidang 10. Tugas saya sebagai english socialization adalah untuk memastikan bahwa warga SMA saya nyaman untuk berbicara bahasa inggris. Tugas tersebut tidak berbeda jauh dengan tugas sebagai kepala bidang 10 karena tetap berfokus pada bahasa inggris. Saya juga pernah diberikan tanggung jawab untuk menjadi ketua acara dari TELESTIC 2019. Dari pengalaman tersebut saya belajar banyak tentang leadership, cara berkomunikasi dengan baik, dll. Tapi hal yang paling membekas dalam diri saya yaitu saya belajar untuk percaya akan orang lain. Pada awal saya berperan menjadi ketua, saya ragu dengan kemampuan diri saya untuk menyusun acara ini. Namun keraguan itu sirna ketika saya ingat bahwa saya bisa memercayai teman-teman saya untuk membantu saya menyusun acara tersebut. Selain itu, saya juga sedang menjadi relawan dalam komunitas Tersalur sebagai staff dari strategic research. Tersalur sendiri adalah komunitas yang berfokus pada kegiatan sosial. Tanggung jawab saya sebagai staff dari strategic research adalah menyusun strategi dan rencana pengembangan komunitas, melakukan riset permasalahan komunitas serta situasi masyarakat, dan melakukan evaluasi untuk tiap projek. Melalui kegiatan tersebut, saya mempelajari dan mengetahui bagaimana keadaan masyarakat khususnya di Indonesia. Dengan pengetahuan yang saya miliki saya berharap saya bisa melakukan kegiatan yang dapat memajukan kesejahteraan masyarakat Indonesia.',	1,	1655743348,	NULL,	0),
('SCHLR-DVRMD-4b4eea',	'USR-DVRMD-5a4fc',	'Diva Ramadhan',	'2003-11-04',	'82234306742',	'Jl. Trenggalek - Ponorogo Km 3, RT 01, RW 01, Desa Buluagung, Kec. Karangan, Kab. Trenggalek, Jawa Timur',	'Teknologi Hasil Pertanian',	'Universitas Jember',	'0.00',	'1',	'Nama saya Diva Ramadhan, mahasiswa Universitas Jember jurusan teknologi hasil pertanian, angkatan 2022. Domisili di Trenggalek, Jawa Timur. Saya memiliki ketertarikan di bidang pangan, bisnis, dan teknologi. Cita-cita saya ingin menjadi peneliti dan dosen yang unggul di masa depan serta memiliki semangat untuk belajar dan mengedepankan kejujuran. Untuk kesibukan saat ini saya aktif dalam mencari informasi yang sekiranya bisa berdampak positf bagi saya salah satunya mengikuti program beasiswa YBB ini tentunya bisa memberikan dampak positif bagi saya dalam hal khususnya untuk membantu dalam pendanaan biaya kuliah. Sehingga orang tua saya juga tidak lebih terbebani lagi dan saya bisa mengukir prestasi kedepannya dan lebih semangat belajar lagi.',	'Mimpi terbesarku adalah bisa membahagiakan orang tua. Saat ini saya sudah ketrima menjadi mahasiswa di Universitas Jember melalui jalur SNMPTN. Hal ini memberikan kebanggaan pada diri saya dan tentunya orang tua dalam melanjutkan pendidikan saya ke perguruan tinggi negeri. Ini adalah sebuah proses yang nanti saya bisa menjadi orang sukses yang bisa memberikan manfaat kepada orang lain serta membuat orang tua bangga. Tidak terlepas dari kondisi orang tua saat ini yang juga memikirkan biaya kuliah saya. Sekiranya dengan saya mengikuti beasiswa ybb ini bisa meringankan beban orang tua. Dan keinginanku bisa menghasilkan uang sendiri dan tidak merepotkan orang tua lagi sehingga bisa memberikan sebagian pendapatan saya ke orang tua. Hal ini bisa saya lakukan dengan mencari kerja sampingan maupun dalam hal pendanaan biaya kuliah saya ikut beberapa beasiswa. Selain itu dalam bidang pendidikan saya ingin memberikan kontribusi terbaik untuk kemajuan pendidikan di Indonesia. Melalui ilmu dan pengalaman saya semoga kedepannya bisa memberikan dampak positif untuk kemajuan pendidikan di Indonesia.',	'Iya, selama menempuh pendidikan SMA saya aktif dalam organisasi di sekolah maupun kegiatan di luar sekolah. Misalnya saya aktif dalam ekstrakurikuler PMR sebagai Badan Pengurus Inti bidang kesehatan, saya diberikan tanggung jawab untuk mengatur kesediaan perlengkapan kesehatan di UKS, selain itu saya juga pernah mengikuti kegiatan Latihan Gabungan tingkat kabupaten pada ekskul pmr sebagai pendamping peserta. Saya aktif juga kegiatan volunteer sebagai relawan penyalur bantuan air bersih pada musim kemarau di Desa saya yang berkolaborasi dengan ekskul pmr di sekolah saya. Tergabung dalam relawan P3K dalam kegiatan pameran pendidikan di Kabupaten Trenggalek. Dan sekarang saya juga menjalani kegiatan volunteer sebagai staff business development dalam mengkampanyekan program pendidikan untuk para pelajar dalam mempersiapkan masa depannya.\r\n',	1,	1655740063,	NULL,	0),
('SCHLR-DVSHF-ef54b5',	'USR-DVSHF-c112e',	'DIVA SHAFIRA ARTANTI',	'2002-12-08',	'85335686885',	'1. Griyo Taman Asri EA-14, RT 33 RW 08, Tawangsari, Taman, Sidoarjo.\r\n2. Jalan Nginden Gang III No. 50, Nginden Jangkungan, Sukolilo, Surabaya.',	'Psikologi',	'Universitas 17 Agustus 1945 Su',	'3.79',	'2',	'Saya sangat suka berkomunikasi dengan orang. Terutama saat berbicara dengan orang baru. Itu menjadi kesenangan dan pembelajaran baru bagi saya. Bahkan di saat diri saya sedang tidak bersemangat atau sedang tidak baik-baik saja. Berinterkasi dengan seseorang ataupun beberapa orang membuat suasana hati saya lebih baik dan membuat diri saya lebih bersemangat.\r\nSaya juga senang belajar hal baru. Hal baru merupakan suatu hal yang menarik bagi saya. Karena bagi saya di dalam hidup ini kita tidak akan mungkin berhenti untuk terus belajar. Saya juga tertarik dengan kesehatan mental. Saya senang belajar mengenai kesehatan mental dan saya sangat peduli dengan kesehatan mental. Oleh karena itu di saat melihat orang sedih saya mudah merasakan kesedihannya dan sering tergerak untuk mendekati dan berbicara dengannya.\r\nSaya senang melatih kepercayaan diri saya, terutama untuk berbicara pada orang lain. Saya senang bekerja kelompok dan memimpin suatu kelompok. Saya fleksibel di dalam mengatur kegiatan dan waktu saya. Saya memiliki banyak kenalan namun saya rasa hanya sedikit yang saya anggap teman dekat. Saya suka menolong orang dan saya senang melihat orang tersenyum dan tertawa apalagi kalau mereka tersenyum dan tertawa karena saya.',	'Mimpi terbesar saya adalah menjadi seorang psikolog yang dapat membantu banyak orang. Baik dari usia muda hingga tua. Saya juga ingin memiliki suatu yayasan yang di dalamnya terdapat banyak kegiatan kemanusiaan. Saya ingin membantu membuat orang bahagia dan menyembuhkan luka batinnya. Terutama bagi keluarga saya, saya ingin memiliki keluarga yang bahagia secara lahir dan batin, harmonis dan romantis.\r\nCara yang sudah terpikirkan sekarang di otak saya ialah dengan menjadi seorang psikolog dan belajar tentang ilmu psikologi. Dimulai dari belajar untuk memahami dan mencintai diri sendiri. Kemudian diiringi dengan peduli dan peka terhadap orang lain. Mau mendengarkan ceritanya dengan baik. Memberikan saran atau solusi tanpa menjudge apabila diminta. Menghibur orang lain yang terlihat susah ataupun kurang bersemangat dalam hidup. Membantu menyelesaikan masalah mereka semampunya.',	'Sejak usia SMP hingga kini, saya tergabung dalam Remaja Masjid. Dimana dari sini saya bisa belajar untuk saling peduli, saling menghargai dan saling kerja sama dengan baik. Di samping itu saya juga belajar untuk berbagi dengan masyarakat setempat, baik itu segi kemanusiaan maupun pendidikan. Seperti membantu memberikan/ menyampaikan pendidikan agama kepada banyak orang, berbagi ta\'jil untuk berbuka puasa pada orang lain, menyiapkan sahur bersama, membantu kelancaran berbagai kegiatan di TPQ, membantu pelaksanaan acara kemandirian keputrian, dan mengajak orang lain untuk lebih semangat beribadah.',	1,	1655739836,	NULL,	0),
('SCHLR-DWKRN-c649ef',	'USR-DWKRN-0eee6',	'Dwi Karunia Fitria Ningrum',	'2002-01-02',	'81281494164',	'Perumahan Taman Buah 1 blok C12/22, Kutabumi, Tangerang, Banten',	'Teknik Informatika',	'Universitas Muhammadiyah Tange',	'3.75',	'4',	'Saya adalah seorang mahasiswa Teknik Informatika. Saat senang sekali belajar mengenai teknologi, terutama di bidang UI/UX Design dan Web Development. Saat ini saya sedang mengikuti virtual internship experience sebagai UX Researcher dari Telkom Digital Amoeba. Saya berhasil memenangkan beasiswa pelatihan UI/UX maupun web development. Diantaranya, Qara\'a Academy Scholarship, 1000 Beasiswa Habiskerja, Beasiswa Coding Dicoding Sponsored by: Homecredit, dan sebagainya. Harapan saya dimasa depan adalah menjadi talenta digital untuk Indonesia Emas di masa depan dengan cara berkarya/berinovasi dibidang teknologi sesuai minat saya.',	'Saya ingin menjadi talenta digital profesional dimasa depan yang melahirkan banyak inovasi yang dapat menyelesaikan masalah banyak orang dengan memanfaatkan kecanggihan teknologi. Karena itu, saya aktif mengikuti berbagai pelatihan dibidang teknologi untuk dapat berkontribusi bagi masyarakat melalui ilmu yang saya miliki.',	'Saya tergabung kedalam komunitas Bridges to The Future dimana komunitas ini membantu anak muda mempersiapkan diri memasuki dunia kerja. \r\n\r\nSelain itu, karena saya aktif mengikuti berbagai pelatihan digital, akhirnya secara tidak langsung saya memiliki interaksi dengan orang-orang yang memiliki minat yang sama dengan saya. Kami bahkan berkolaborasi ketika mengerjakan study case yang harus dikerjakan secara berkelompok.\r\n\r\nTerakhir, saat ini saya sedang melaksanakan intern sebagai UX Researcher di Telkom Digital Academy. Program ini bersifat project-based intern dimana kami diminta untuk mempelajari sekaligus mengerjakan tugas di setiap minggunya. Diakhir program kami akan diberikan tugas akhir yang mirip dengan project real di dunia kerja ',	1,	1655712805,	NULL,	0),
('SCHLR-DWKRT-c00889',	'USR-DWKRT-39b41',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655711022,	NULL,	0),
('SCHLR-DWNLF-7da9c2',	'USR-DWNLF-d6568',	'Dwi Naila Faddila',	'2003-06-15',	'895635859227',	'Kisaran, Medan.',	'Matematika/Pendidikan Matemati',	'Universitas Negeri Medan',	'3.37',	'4',	'Perkenalkan nama saya Dwi Naila Faddila, biasa dipanggil Naila. Saya berasal dari keluarga yang sederhana. Ayah saya bekerja sebagai karyawan swasta dan ibu sebagai ibu rumah tangga. Saya anak ke 2 dari 2 bersaudara. Ibu saya meninggal sewaktu saya SMA. Kondisi ekonomi semakin menurun semenjak ibu meninggal ditambah lagi kasus covid 19 melanda Indonesia. Saat ini saya sedang menempuh pendidikan sebagai mahasiswa semester 4 program studi pendidikan matematika di Universitas Negeri Medan. Selama 2 tahun saya kuliah, saya memiliki kesempatan untuk magang di salah satu platform pendidikan yaitu Akademis.id sebagai master teacher class atau sebagai tutor. Saya bertanggung jawab dalam membuat video pembelajaran mengenai pembahasan materi dan soal try out seputar matematika saintek. Selanjutnya video akan di upload pada website Akademis.id agar dapat di akses oleh siswa SMA yang ingin meraih universitas yang diinginkan. Saya juga mengikuti volunteer yang dilaksanakan secara online dikarenakan kasus covid yang mengharuskan work from home (WFH). Kegiatan volunteer yang saya ikuti berupa campaign online mengenai “Advocates of Gender Equality in Education” dan “Personal Branding in the Scope of Identity Exploration”. Saya memutuskan untuk memilih topik tersebut karena masih terjadi ketimpangan dalam kesetaran gender di bidang Pendidikan dan pentingnya pemuda dan pemudi untuk membangun personal branding di zaman sekarang. Selain itu, saya juga memiliki kesempatan untuk menjadi guru privat pada siswa SD dan SMP. Saya bertugas untuk membimbing dan menyalurkan pengetahuan yang saya miliki kepeda murid saya. Walaupun saya hanya memiliki 3 murid namun saya merasa bersyukur dan senang karena pada akhirnya saya dapat memberikan pembelajaran secara langsung. Saya mengikuti organisasi Lembaga Penalaran dan Penelitian Ilmiah Mahasiswa (LP2IM) sebagai staff di divisi Pengkajian Keilmuan dan Keprofesian (PKK). Saya memiliki minat dalam bidang pendidikan, hal itu dapat dibuktikan dengan latar belakang pendidikan yang saya tempuh dan pengalaman yang saya miliki semuanya berhubungan dengan bidang tersebut. \r\nHarapannya jika saya diterima pada beasiswa ini, saya tidak hanya menyalurkan ilmu dan membantu orang lain dalam menempuh pendidikan tapi saya juga dapat menempuh pendidikan yang tinggi. Saya ingin ikut andil dalam membangun kualitas pendidikan di Indonesia menjadi lebih baik lagi dan merata. Dengan terus mengembangkan potensi dan pengalaman yang saya miliki selama kuliah saya yakin bahwa saya dapat membangun langkah kecil dalam mewujudkan hal tersebut. Selain itu, saya ingin membuktikan jika saya mampu menempuh pendidikan yang tinggi walaupun saya berasal dari keluarga sederhana.',	'Mimpi terbesar saya adalah financial freedom. Saya dapat berdiri di kaki saya sendiri dan membiayai hidup saya sendiri. Semenjak saya kehilangan ibu saya, saya belajar banyak hal. Salah satunya adalah bahwa saya tidak bisa selamanya bergantung terhadap orang lain, sekalipun orang itu adalah orang tua saya sendiri. Dengan financial freedom saya dapat lebih banyak membantu orang. Menjadi pendidik baik itu guru ataupun dosen juga termasuk dalam mimpi saya. Namun, saya ingin turut andil dalam membangun kualitas pendidikan Indonesia menjadi lebih baik dan merata tidak hanya dari segi jasa tapi juga materi. Oleh karena itu saya mulai langkah-langkah kecil untuk mewujudkan mimpi saya tersebut agar bisa mewujudkan mimpi saya yang lain. Langkah-langkah kecil yang saya lakukan adalah:\r\n•	Menempuh pendidikan setinggi mungkin dikarenakan program studi yang saya ambil adalah pendidikan maka menempuh pendidikan yang tinggi untuk memperoleh pengetahuan itu sangat penting.\r\n•	Mencari pengalaman dengan mengikuti kegiatan magang, volunteer, dan workshop untuk mengembangkan skill dalam bidang pendidikan ataupun skill yang diperlukan untuk dunia kerja nantinya, seperti: excel, leadership, kemampuan bahasa inggris, dll.\r\n•	Mengikuti courses \r\nsaya akan mengikuti courses mengenai financial, conten writer, copy writer. Saya memiliki ketertarikan dalam menulis oleh karena itu saya ingin mendalami conten writer dan copy writer. Saya memilih financial karena untuk financial freedom belajar financial dan investasi sangat diperlukan. Untuk data analyst, saya tertarik untuk belajar hal baru.\r\n•	Memperluas koneksi terhadap banyak orang.\r\nHal ini diperlukan untuk membantu saya dalam dunia kerja nantinya. Untuk mewujudkan hal tersebut saya mulai mengikuti organisai dan conference untuk menjalin koneksi dengan banyak orang.\r\nApapun pekerjaan saya nanti, mau pekerjaan saya sebagai pendidik, content writer, copy writer atau data analyst saya tidak akan bekerja untuk uang tapi uang yang bekerja untuk saya. Saya akan belajar keras untuk mengenali masalah keuangan dan investasi. Untuk membantu banyak orang saya harus dapat membantu diri saya sendiri untuk dapat hidup.',	'Selama kuliah saya mengikuti organisasi Lembaga Penalaran dan Penelitian Ilmiah Mahasiswa (LP2IM) namun tidak begitu banyak kegiatan yang dilakukan katena perkuliahan dan kegiatan organisasi dilakukan secara daring. Saya akan membahas mengenai pengalaman organisasi selama SMA. Saat SMA saya diberikan kesempatan sebagai sekretaris umum pada organisasi Rohis (Rohani Islam). Saya bertugas untuk mengurus dokumen seperti surat menyurat, data tiap anggota, proposal kegiatan, dll. Selama saya menjabat sebagai sekretaris umum saya dan tim membuat beberapa kegiatan seperti isra’ miraj, maulid nabi, halal bi halal, pesantren kilat, dan perlombaan islami antar kelas. Setelah mengikuti organisasi tersebut, saya menjadi dapat berkomunikasi dengan orang lain yang memiliki jenjang usia yang jauh dengan saya. Saya belajar untuk mengambil tindakan dalam waktu yang singkat. Saya juga menjadi mengerti jika ada begitu banyak sudut pandang dan belajar bagaimana menyikapi sudut pandang yang berbeda tanpa menyudutkam. Terakhir, saya belajar banyak mengenai kerja sama bersama tim.',	1,	1655741801,	NULL,	0),
('SCHLR-DWNRL-3d91d2',	'USR-DWNRL-9d694',	'Dewi Nur Laili Kartika Sari',	'2002-03-12',	'81553405707',	'Dsn. Sedati, Ds. Sedati, Kec. Ngoro, Kab. Mojokerto, Prov. Jawa Timur, Indonesia',	'Teknologi Pendidikan/S1 Teknol',	'Universitas Negeri Malang ',	'3.70',	'2',	'Saya adalah seorang pelajar yang saat ini menempuh pendidikan di perguruan tinggi negeri. Saya tipe orang yang tekun, rajin, rapi, dan sabar. Saya sabar dalam menjalani sekolah saya, dari SD sampai SMA saya menempuh pendidikan di sekolah negeri, dan hingga saat ini saya diterima di perguruan tinggi negeri. Saya orang yang sabar dan pantang menyerah, kuat dan mau belajar dalam menerima sesuatu yang berat atau baru, serta rela berkorban.',	'Mimpi terbesar saya yaitu saya ingin meraih cita cita saya agar bisa memperoleh pekerjaan yang baik dan agar bisa bermanfaat untuk banyak orang, tidak menyusahkan orang lain, dan ingin menolong serta bermanfaat untuk banyak orang. ',	'Iya. Saya saat ini sedang mengikuti organisasi di perkuliahan yaitu Himpunan Mahasiswa Departemen Teknologi Pendidikan Universitas Negeri Malang. Saya belajar banyak di organisasi ini, banyak hal baru yang saya banyak belajar dari organisasi ini. ',	1,	1654616168,	NULL,	0),
('SCHLR-DWRGY-a1a938',	'USR-DWRGY-cae8c',	'Dewi Argyanti Wirasatyani',	'2006-02-04',	'87752927051',	'Perumahan Citra Tropodo Jl.Citra Anggrek no.14 Waru Sidoarjo',	'IPA',	'SMA KRISTEN PETRA 5 SURABAYA',	'3.00',	'5',	'Saya adalah seorang pelajar aktif yang saat ini sedang menempuh pendidikan kelas 12 SMA di SMA Petra 5 Surabaya jurusan IPA. Saya seorang yang kreatif,inovatif,komunikatif, serta kritis dalam menyelesaikan suatu masalah. Selain itu saya juga suka bersosialisasi dan mampu bekerja secara optimal dalam kelompok. ',	'Mimpi terbesar saya yaitu supaya bisa memeratakan kelayakan pendidikan di Indonesia terutama di daerah daerah terpencil dengan tujuan untuk memberi mereka kesempatan dalam berpendidikan dan meraih mimpi setinggi tinggi nya tanpa adanya batasan finansial,fasilitas, serta letak geografis daerah yang tidak memungkinkan. \r\nCara saya untuk mewujudkannya, untuk saat ini cara yang bisa saya lakukan yaitu dengan rajin belajar serta mengikuti beberapa kegiatan volunteer untuk mendukung potensi dan mewujudkan mimpi saya sedikit demi sedikit. Untuk kedepannya saya akan mencoba untuk mengabdi menjadi sukarelawan mengajar daerah terpencil di Indonesia sekaligus menganalisa hal hal yang bisa saya lakukan untuk mendukung kemajuan pemerataan pendidikan di daerah terpencil Indonesia.',	'Saya tergabung dalam kelompok paduan suara di sekolah saya yang bernama It Is Us.\r\nKebetulan saya juga berkesempatan menjabat sebagai ketua paduan suara disini. Selama masa jabatan saya, sudah banyak projek yang dapat saya selesaikan dengan baik. Diantaranya yaitu penampilan It Is Us saat ibadah paskah di sekolah dan pada saat MPLS. Dimana pada saat itu, saya sebagai ketua kelompok harus bisa mengambil keputusan yang tepat dalam mengatasi masalah perbedaan argumen diantara kelompok serta mencari solusi yang paling tepat dan pas kemudian saya aplikasikan saat penampilan sehingga kelompok padus It Is Us dapat berjalan secara optimal dan lancar.',	1,	1655637968,	NULL,	0),
('SCHLR-DWTST-cc2e1c',	'USR-DWTST-065c9',	'Adewati Stefani Pinis',	'2002-08-15',	'82146467282',	'Kupang',	'Psikologi',	'Universitas Nusa Cendana',	'3.46',	'6',	'Nama saya Adewati Stefani Pinis, saya merupakan anak ke 2 dari 8 bersaudara. Ayah saya adalah seorang penjual ikan dan ibu saya adalah seorang IRT. Status ekonomi saya adalah menengah bawah dengan penghasilan orang tua yang sangat sedikit. Saya memiliki harapan yang kuat untuk bisa tetap menyelesaikan kuliah saya dengan beasiswa yang mungkin kan diberikan.',	'Saya mempunyai mimpi yang besar yaitu menjadi seorang psikolog anak. Tugas utama saya yaitu mencegah terjadinya kekerasan pada anak yang dapat menyebabkan trauma yang akan berefek negatif ketika remaja dan dewasa nanti.',	'Saya mengikuti organisasi keagamaan dan organisasi kemahasiswaan yang ada di kampus dengan banyak kegiatan relawan didalamnya.',	1,	1653566187,	NULL,	0),
('SCHLR-DYNSY-560abe',	'USR-DYNSY-d74e9',	'DAYANA SYIFA ATAYU',	'2003-04-02',	'85162616089',	'Bunga Tanjung, Kecamatan Batipuh, Kabupaten Tanah Datar',	'Communication and Performing A',	'University of Calabria',	'0.00',	'1',	'Saya merupakan individu yang memiliki antusias dan motivasi yang tinggi. Terampil dalam kerjasama tim serta persisten menemukan solusi kreatif yang penuh inovasi untuk pemecahan suatu masalah. ',	'Saya ingin menjadi sosok yang inspiratif. Saya suka tantangan,selalu melakukan yang terbaik, dan selalu berusaha memperjuangkan mimpi saya. Hal ini dibuktikan dengan lulus di University of Calabria di Italia dengan beasiswa merit universitasnya. Saya berhasil mencari informasi, menyusun perencanaan jadwal, dan persiapan beasiswa dalam waktu beberapa bulan. ',	'Saya pernah menjadi Paskibraka Provinsi Sumatera Barat tahun 2019, dengan ilmu kepemimpinan, disiplin, dan kerjasama tim ,yang telah diberikan selama pelatihan Paskibraka, saya menyalurkannya untuk generasi selanjutnya yang akan mengikuti seleksi pemilihan paskibraka, dalam sebuah organisasi kopasis. Kemudian saya pernah akan mengikuti volunteer Wonderful Indonesia Social Humanity dan terpilih sebagai 20 peserta dengan ide terbaik yang akan digunakan untuk program kegiatan volunteer. Selain itu, saya memiliki minat di bidang desain setelah menjuarai beberapa kompetisi di bidang desain poster, sekarang saya aktif di divisi desain grafis untuk konten media sosial dari organisasi pemuda The Golden Ark. ',	1,	1655604349,	NULL,	0),
('SCHLR-DYNSY-9076e6',	'USR-DYNSY-d74e9',	'DAYANA SYIFA ATAYU',	'2003-04-02',	'85162616089',	'Haru, Bunga Tanjung, Kecamatan Batipuh ,Kabupaten Tanah Datar, Provinsi Sumatera Barat',	'Communication and Performing A',	'University of Calabria',	'0.00',	'1',	'Saya merupakan individu yang memiliki antusias dan motivasi yang tinggi. Terampil dalam kerjasama tim serta persisten menemukan solusi kreatif yang penuh inovasi untuk pemecahan suatu masalah. ',	'Saya ingin menjadi sosok yang inspiratif. Saya suka tantangan,selalu melakukan yang terbaik, dan selalu berusaha memperjuangkan mimpi saya. Hal ini dibuktikan dengan lulus di University of Calabria di Italia dengan beasiswa merit universitasnya. Saya berhasil mencari informasi, menyusun perencanaan jadwal, dan persiapan beasiswa dalam waktu beberapa bulan. ',	'Saya pernah menjadi Paskibraka Provinsi Sumatera Barat tahun 2019, dengan ilmu kepemimpinan, disiplin, dan kerjasama tim ,yang telah diberikan selama pelatihan Paskibraka, saya menyalurkannya untuk generasi selanjutnya yang akan mengikuti seleksi pemilihan paskibraka, dalam sebuah organisasi kopasis. Kemudian saya pernah akan mengikuti volunteer Wonderful Indonesia Social Humanity dan terpilih sebagai 20 peserta dengan ide terbaik yang akan digunakan untuk program kegiatan volunteer. Selain itu, saya memiliki minat di bidang desain setelah menjuarai beberapa kompetisi di bidang desain poster, sekarang saya aktif di divisi desain grafis untuk konten media sosial dari organisasi pemuda The Golden Ark. ',	1,	1655723755,	NULL,	0),
('SCHLR-DYSTR-6c909a',	'USR-DYSTR-e3bae',	'dyastari cahya egita',	'2003-03-22',	'65975344407',	'grendeng, Purwokerto Utara, Kab Banyumas',	'pendidikan ekonomi',	'Universitas Jnedral oedirman',	'3.73',	'2',	'saya orang yang menyesuakan situasi, dimana saya berada dan harus bertindak. saya punya kekurangan yaitu moodswing, untuk itu saya butuh mendengarkan musik lofi chill untuk mengembalikan mood saya. akan tetapi saya juga punya kelebihan. saya pribadi yang suka hal hal baru, memulai pembelajaran dengan gaya belajar sendiri, suka keterampilan tangan seperti meronce dan merajut dengan motif yang saya buat sendiri, saya sebut diri saya kreatif.',	'mimpi terbesar saya adalah menjadi orang sukses baik menjadi dosen maupunpengusaha , maupun hal lainnya. menjadi sosok itu butuh ketekunan dalam mempelajari hal hal yang menjadi langkah kedepan seperti belajar dikampus dengan giat, menambah pengalamandengan mengikuti lomba lomba.',	'sejak SMA saya mulai terjun ke organisasi yaitu rohis ( organisasi islam), disana saya mendapat pengalaman baik dari sisi agama maupun memanage organisasi karena di tahun kedua menjadi kepala bidang media di sana. memasuki kuliah saya mencari suasana baru yaitu mengikuti ukm kewirausahaan bursa ( salah satu ukm yg ada di FEB Unsoed. disini saya masih menjadi staff namun pengalamannya saat ini sedang menjadi koordinator Humas di acara kompetisi bisnis nasional (bpc2022), lalu sering menjadi mc di acara yg diselenggarakan ukm saya. ',	1,	1653565996,	NULL,	0),
('SCHLR-DYTRT-d5d004',	'USR-DYTRT-44a7a',	'Dayu Tirta Juliani',	'2003-07-31',	'82269161515',	'Jl. Kusuma Bangsa RT 007 Kel. Gunung Lingas Tarakan',	'Ekonomi Pembangunan/Ekonomi',	'Universitas Borneo Tarakan',	'3.51',	'2',	'Saya adalah orang yang penuh ambisi, ketika saya memulai sesuatu saya akan memastikan saya akan menyelesaikannya dengan baik dan sesuai dengan apa yang saya rencanakan.',	'Mimpi terbesar saya adalah menjadikan pendidikan yang saya tempuh saat ini tidak sia-sia dan berguna untuk saya pribadi maupun sekitar saya. Saya yakin bisa mewujudkan mimpi tersebut dengan mengaplikasikan dalam kehidupan sehari-hari. ',	'Saya memiliki pengalaman dalam beroganisasi, awal menjadi mahasiswa baru saya aktif dalam kegiatan dan kepengurusan di himpunan mahasiwa jurusan saya.',	1,	1654261501,	NULL,	0),
('SCHLR-DZKYH-077d7d',	'USR-DZKYH-82aa6',	'Dzakiyah Lubna',	'2001-05-08',	'81295299301',	'Jln. Pattimura Rt/Rw 002/002, Kelurahan Tanjung Paku, Kecamatan Tanjung Harapan, Kota Solok, Sumatera Barat',	'MATEMATIKA ',	'UNIVERSITAS NEGERI PADANG',	'2.98',	'5',	'Saya adalah anak ke-2 dari 5 bersaudara, Saya dilahirkan dari keluarga yang sederhana, Ayah saya bekerja sebagai pegawai swasta dan ibu saya seorang ibu rumah tangga. Saya kuliah di Universitas Negeri Padang dan masuk lewat jalur yg dinamakan SNMPTN, saya lulus dengan jurusan matematika yang mana pelajaran favorit saya dari dulu. Saya juga mengikuti organisasi seperti Pramuka. Kesibukan saya sekarang yakni kuliah dan kerja sambilan menjadi seorang pembina pramuka di sebuah sekolah di kota padang',	'Saya ingin menjadi seorang akuntan dan bekerja di Bank Indonesia, cara saya untuk mewujudkan nya dengan belajar dan mengikuti pelatihan agar mengasah kemampuan saya di dalam bidang tersebut',	'Saya pernah mengikuti sekolah relawan yang beberapa waktu lalu di adakan oleh kampus saya, Saya juga mengikuti organisasi Pramuka dan dari sana saya bnyak mendapatkan pelajaran dan juga pengalaman',	1,	1654952114,	NULL,	0),
('SCHLR-DZMKH-7b1658',	'USR-DZMKH-b731b',	'Dizma Kharim Aliansyah',	'2005-01-30',	'88227736331',	'Baron cilik rt 3 rw 6, Bumi, Laweyan, Surakarta, Jawa Tengah ',	'IPS',	'SMA NEGERI 7 SURAKARTA ',	'8.9',	'4',	'Saya adalah seorang pelajar 17 tahun yang besekolah di SMA Negeri 7 Surakarta, di masa sekolah saya menghabiskan waktu untuk berusaha upgrade diri and skill. Saya mengupgrade diri dengan cara mengikuti beberapa kegiatan yang dapat menjadikan saya pribadi yang lebih baik lagi. Selain itu, saya ingin menjadikan hidup saya menjadi hidup yang berguna bagi masyarakat sekitar. ',	'Mimpi terbesar saya adalah, saya ingin membanggakan dan membuktikan kalau saya bisa kepada kedua orang tua saya yang mana kedua orang saya sering tidak yakin kalau saya tidak bisa, oleh karena itu saya ingin membuktikannya dengan belajar bersungguh-sungguh untuk dapat mewujudkan cita\" yang saya inginkan',	'Iya, saya mengikuti berbagai organisasi di internal sekolah maupun eksternal, untuk di internal sendiri saya mengikuti osis, paskibra, pecinta alam, rohis ',	1,	1654259425,	NULL,	0),
('SCHLR-FBFBR-4f6991',	'USR-FBFBR-a9584',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655725511,	NULL,	0),
('SCHLR-FBYND-3f59bd',	'USR-FBYND-e7489',	'Febi Ayunda Sari',	'2002-01-04',	'81362271286',	'Hessa Air Genting dusun v silat-laut kec. Air batu kan. Asahan Sumatera Utara ',	'Pendidikan Agama Islam / Tarbi',	'Institut Agama Islam Daar al U',	'3.46',	'4',	'Saya adalah seorang mahasiswi aktif semester 4 dari program studi pendidikan agama islam kesibukan saya saat ini sebagai mahasiswi dan aktif dalam organisasi kampus yaitu organisasi lembaga dakwah kampus, saya mengambil jalur kuliah sabtu-minggu, saat hari senin-jumat saya mengisi rutinitas keseharian saya dengan tenaga pendidik anak usia dini, menjadi guru les privat anak-anak sd dan saat sore hari saya juga sebagai guru ngaji anak-anak dilingkungan rumah saya.\r\nDemikian lah cerita singkat tentang diri saya seorang wanita yang ingin terus mengejar pendidikan dan ingin berkontribusi dalam pembangunan bangsa dengan mengamalkan ilmu yang saya miliki',	'Saya mempunyai mimpi untuk menjadi pelopor dalam pembangunan bangsa dan menyiapkan sumber daya manusia yang berkualitas, seperti membuat wadah rumah belajar bagi anak anak desa untuk menumbuhkan kesadaran mereka tentang pentingnya pendidikan. Sesuai dengan jurusan saya di kuliah yaitu bidang pendidikan oleh karena itu saya ingin  mengabdikan dan membagilkan ilmu yang memilki kepada masyarakat sekitar khususnya para generasi muda yang akan menjadi pengurus bangsa ini adapun kontribusi yang saya lakukan untuk pembangunan bangsa ini yaitu ikut berperan aktif dalam menciptakan generasi bangsa yang berpendidikan. \r\nKarena dalam pembangunan bangsa aset penting nya yaitu rakyat in Indonesia itu sendiri oleh karena itu kita harus menyiapkan generasi muda yang berkualitas yang dengan memperbaiki dalam hal pendidikan karena pendidikan adalah tonggak dasar dalam pembangunan bangsa. Cara mewujudkan kan nya yaitu dengan tetap melanjutkan studi saya',	'Ya saya mempunyai pengalaman dalam berorganisasi, saat saya dibangku SMA saya aktif berorganisasi dalam organisasi siswa intra sekolah sebagai ketua bidang karya ilmiah, saya juga pengikut oranganisasi pramuka dan paskibra, dan juga ikut berpartisipasi dalam kegiatan kemanusiaan dan relawan. \r\nSaat berkuliah saya aktif berorganisasi dalam organisasi lembaga dakwah kampus sebagai ketua bidang kemuslimahan, yang mana organisasi tersebut juga terdapat banyak organisasi kemanusiaan\r\nDilingkungan masyarakat saya juga ikut berkontribusi dalam kegiatan kemanusiaan seperti anggota tarang taruna.',	1,	1654418559,	NULL,	0),
('SCHLR-FBYND-6c2ea6',	'USR-FBYND-e7489',	'Febi Ayunda Sari',	'2002-01-04',	'81362271286',	'Hessa Air Genting dusun v silat-laut kec. Air batu kan. Asahan Sumatera Utara ',	'Pendidikan Agama Islam / Tarbi',	'Institut Agama Islam Daar al U',	'3.46',	'4',	'Saya adalah seorang mahasiswi aktif semester 4 dari program studi pendidikan agama islam kesibukan saya saat ini sebagai mahasiswi dan aktif dalam organisasi kampus yaitu organisasi lembaga dakwah kampus, saya mengambil jalur kuliah sabtu-minggu, saat hari senin-jumat saya mengisi rutinitas keseharian saya dengan tenaga pendidik anak usia dini, menjadi guru les privat anak-anak sd dan saat sore hari saya juga sebagai guru ngaji anak-anak dilingkungan rumah saya.\r\nDemikian lah cerita singkat tentang diri saya seorang wanita yang ingin terus mengejar pendidikan dan ingin berkontribusi dalam pembangunan bangsa dengan mengamalkan ilmu yang saya miliki',	'Saya mempunyai mimpi untuk menjadi pelopor dalam pembangunan bangsa dan menyiapkan sumber daya manusia yang berkualitas, seperti membuat wadah rumah belajar bagi anak anak desa untuk menumbuhkan kesadaran mereka tentang pentingnya pendidikan. Sesuai dengan jurusan saya di kuliah yaitu bidang pendidikan oleh karena itu saya ingin  mengabdikan dan membagilkan ilmu yang memilki kepada masyarakat sekitar khususnya para generasi muda yang akan menjadi pengurus bangsa ini adapun kontribusi yang saya lakukan untuk pembangunan bangsa ini yaitu ikut berperan aktif dalam menciptakan generasi bangsa yang berpendidikan. \r\nKarena dalam pembangunan bangsa aset penting nya yaitu rakyat in Indonesia itu sendiri oleh karena itu kita harus menyiapkan generasi muda yang berkualitas yang dengan memperbaiki dalam hal pendidikan karena pendidikan adalah tonggak dasar dalam pembangunan bangsa. Cara mewujudkan kan nya yaitu dengan tetap melanjutkan studi saya',	'Ya saya mempunyai pengalaman dalam berorganisasi, saat saya dibangku SMA saya aktif berorganisasi dalam organisasi siswa intra sekolah sebagai ketua bidang karya ilmiah, saya juga pengikut oranganisasi pramuka dan paskibra, dan juga ikut berpartisipasi dalam kegiatan kemanusiaan dan relawan. \r\nSaat berkuliah saya aktif berorganisasi dalam organisasi lembaga dakwah kampus sebagai ketua bidang kemuslimahan, yang mana organisasi tersebut juga terdapat banyak organisasi kemanusiaan\r\nDilingkungan masyarakat saya juga ikut berkontribusi dalam kegiatan kemanusiaan seperti anggota tarang taruna.',	1,	1654418507,	NULL,	0),
('SCHLR-FBYNT-21ad85',	'USR-FBYNT-a72f5',	'Febiyanti',	'2003-02-25',	'85975343039',	'Desa Langgen, Rt 10 Rw 03, Kec. Talang, Kab. Tegal',	'AkuntansiFakultas Ekonomika da',	'Universitas Diponegoro',	'3.73',	'2',	'Saya adalah pribadi yang rajin dan konsisten. Hal ini dibuktikan dengan salah satu pencapaian terbesar sejauh ini, yaitu berhasil masuk di perguruan tinggi negeri tanpa melalui tahapan tes sama sekali. Perlu proses yang panjang bagi saya untuk mendapat prestasi ini, dengan penuh perjuangan mempertahankan nilai-nilai yang konstan dan cenderung naik. Selain itu, saya juga merupakan pribadi dengan kepekaan yang tinggi terhadap kondisi di sekitar. Contoh yang dapat saya berikan yaitu ketika ditempatkan dalam kondisi sulit, saya akan lebih memperhatikan kepentingan orang lain di atas kepentingan pribadi.',	'Mimpi terbesar saya adalah bermanfaat bagi keluarga dan banyak orang. Untuk dapat mewujudkan mimpi tersebut, hal-hal yang telah saya investasikan dari sekarang adalah belajar di berbagai bidang agar di kemudian hari saya dapat merealisasikan mimpi di atas. Saya selalu berpikir bahwa bermanfaat bagi banyak pihak berarti saya harus mampu memberikan efek positif di banyak hal yang mana harus saya kuasai. Oleh karena itu, pendidikan adalah salah satu hal terpenting bagi saya.',	'Pengalaman organisasi pertama saya adalah ketika duduk di bangku SMA. Pada saat itu, saya menjadi anggota di dalam organisasi karya ilmiah remaja khususnya di bidang sosial. Kemudian, di tahun pertama perkuliahan saya mengikuti organisasi legislatif di kampus. Tugas saya disini adalah membuat rancangan anggaran belanja kegiatan dan juga menyusun laporannya.',	1,	1655307456,	NULL,	0),
('SCHLR-FDHLH-08371b',	'USR-FDHLH-1456f',	'Fadhilah Akbar Adyana Tsani',	'2001-01-27',	'882009442143',	'Perum Griya Bukit Jaya Blok M 21/ 1 Rt 07 Rw 30. Desa Tlajung Udik, Kec. Gunung Putri. Kab. Bogor',	'Pendidikan Bahasa Arab Tarbiya',	'Universitas Darussalam Gontor',	'3.68',	'5',	'saya merupakan mahasiswa aktif program studi Pendidikan Bahasa Arab Universitas Darussalam Gontor semester 5. selain berkuliah saya juga aktif mengikuti beberapa organisasi dan sering dilibatkan dalam kepanitiaan baik dalam skala besar maupun kecil. ',	'mimpi terbesar saya ialah meningkatkan pendidikan di Indonesia dan menjadikannya unggul minimal dibidang ASEAN.  cara mewujudkannya ialah tentu dengan menimbun ilmu sebanyak mungkin didalam diri saya agar nantinya dapat disalurkan kepada anak didik',	'saya aktif berorganisasi didalam kampus maupun diluar kampus. didalam kampus saya mengikuti organisasi kepramukaan, kepenulisan dan public speaking, diluar kampus saya mengikuti organisasi editing. dalam kepramukaan saya mengajar di sekolah dasar dan juga menjadi mahasiswa pecinta alam. dikepenulisan, saya turut membantu program studi saya menjadi website terbaik di kampus tahun 2021-2022. pada public speaking saya beberapa kali diminta untuk menjadi moderator acara namun beberapa diantaranya saya berhalangan. dalam editing, saya menjadi pemegang penuh akun instagram dan menjadi desainer di beberapa akun instagram UKM dan HMP',	1,	1655030367,	NULL,	0),
('SCHLR-FDLNR-92b9c4',	'USR-FDLNR-3be87',	'Fadiela nurlitasari.D',	'2003-04-15',	'895603558266',	'Simpang line gampong padang sakti muara satu Lhokseumawr Aceh',	'Ilmu hukun',	'Universitas Malikussaleh',	'3.75',	'2',	'Saya sangat gemar membaca entah itu novel atau buku ilmu pengetahuan lainnya. Saya juga memiliki kemampuan meskipun dalam hal masih belajar tetapi saya sangat menyukai bidang public speaking atupun debat, sejak sekolah menengat atas saya mengikuti organisasi pmr dimana saya mengambil peran sebagai pree educator hal tersebut mengajarkan saya untuk berbicara didepan umum kepada siswa lainnya ataupun masyarakat , sejak saat itulah kegemaran saya menjadikan diri saya untuk melanjutkan study dengan jurusan hukum',	'Dengan kegemaran yg saya miliki saya bermimpi hak tersebut akan sangat berguna sekali untuk kedepanya yaitu menjadi jaksa, meskipun sangat sulit untuk dicapai akan tetapi setiap usaha yg dilakukan dengan sungguh sungguh pasti akan mendapatkan hasil yg setimpal walaupun hal apa saja bisa terjadi dan diluar ekspetasi. Cara saya untuk mewujudkan impian saya adalah terus menambah ilmu membaca buku ilmu pengetahuan dan wawasan saya serta menambah relasi untuk membantu saya meningkatkan soft kill yg saya miliki.',	'Saya memiliki pengalam organisasi dan juga menjadi relawan. Saat sekolah menengah atas saya mengikuti organisasi PMR(palang merah remaja) dimana organisasi tersebut bukan hanya mengajarkan betapa pentingnya pertolongan untuk sesorang yg sedang terluka akan tetapi banyak hal yg diajarkan seperti pentingnya merawat orang tua kelak dan disana jg melakukan sosialisasi yg dimana terjun langsung ke masyarakat. Banyak hal yg dapat dipelajari dari sosialisasi itu, mengajarkan betapa pentingnya walau hanya sesendok beras untuk bisa seseorang mengisi perut dari kelaparan. Memberikan sembako untuk masyrakat yg membutukan  dan cek kesehatan  gratis bagi masyarakat. Hal itu menjadikan kami relawan bagi diri sendiri dan juga orang lain tanpa pamrih dan menolong sesama. Saat perkuliahan sekarang akibat pandemi organisasi baru akan dibuka pada semester 2 dan itu tidak semuanya. Saya mengikuti organisasi eksternal paguyuban medan. Dan internal kampus yaitu FKPH(Forum kajian dan penulisan hukum) disitu kami diajarkan bagaimana mengkaji sebuah buku dengan teliti, belajar debat dengan etika yg tepat dan mencari informasi sesuai fakta disitulah saya memiliki kecocokan untuk bergabung di organisasi tersebut untuk lebih belajar lagi dan meningkatkan wawasam dam kemampuan saya setelah lama dirumah (daring)',	1,	1655225070,	NULL,	0),
('SCHLR-FFHDR-aa7d49',	'USR-FFHDR-7751e',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654750493,	NULL,	0),
('SCHLR-FKHDN-4ea8d6',	'USR-FKHDN-49a61',	'FAAKIHUDIN AKHMAD',	'2005-04-19',	'82313233675',	'Jl.MT.Haryono no.58 Desa Saditan, Kec.Brebes, Kab.Brebes',	'Mipa',	'SMA Negeri 1 Brebes',	'8.90',	'4',	'Perkenalkan nama saya Faakihudin Akhmad, merupakan anak ke-2 dari 6 bersaudara, yang lahir dari rahim seorang ibu yang sangat luar biasa. juga anak dari seorang ayah yang tak kalah luar biasanya.\r\n\r\nSaya tak lebih hanya pemuda kumal yang suka berpetualang dan menggali hikmah dari setiap kisah perjalanannya. Saya mempunyai hobi menulis sejak kecil. Kini, pemuda kumal yang berhasil lahir ke bumi tepat pada tanggal 19 April 2005 yang mana tepat 17 tahun kemarin telah berhasil mewujudkan mimpinya yakni menerbitkan buku solo. Saya lahir di Kab.Pemalang dan tumbuh besar di tiga daerah (Tegal, Brebes, Pemalang) ini sedang berpetualangan mencari ilmu di sebuah pendidikan di Ponpes Assalafiyah 2 Brebes dan juga di SMA Negeri 1 Brebes, yang mana satu tahun lagi mau tamat.\r\n\r\nSemua ini berawal sejak saya duduk di bangku smp, dimana saat itu sedang berlangsung pelajaran bahasa indonesia bab puisi. itu pertama kali penulis mengenal sebuah karya sastra bernama \"puisi\". dari sinilah penulis mulai tertarik dan kepo tentang \"apasih puisi itu?\". singkat cerita penulis sudah mulai sedikit-sedikit berani menuangkan kedalam pena. sampai akhirnya benar-benar \"jatuh cinta\" sama puisi, dan menjadikannya sebuah hobi. \r\n\r\nawalnya merasa minder, karena saya sendiri yang hanya lulusan SMP PGRI Brebes, yang mana sekolah tersebut swasta. dan tidak sedikit orang yang memandang rendah SMP itu. namun, anggapan rendah tersebut saya jadikan sebagai \"motivasi\" buat kedepan. Saya memiliki tekad besar untuk membungkam anggapan tersebut. dan alhamdulillah, allah mempermudah jalannya. sehingga anggapan itu sedikit demi sedikit mulai hilang.  \r\n\r\nMaka dari itu, melalui karya tersebut, saya ingin berbagi kisah-kisah penuh \r\nhikmah tentang pengalaman dan keseruan perjalanan hidup saya\r\nselama di pesantren, sekolah, dll ',	'Mimpi terbesarku dari dulu ialah ingin bisa membanggakan kedua orang tua. Karena hakikatnya orang sukses itu merupakan hasil implementasi dari dukungan, doa kedua orang tua. Maka dari itu saya selalu ingin bisa membanggakan orang tua. Dengan cara bersungguh-sungguh dalam menuntut ilmu, baik ilmu umum maupun ilmu agama (pesantren). ',	'Banyak:v tapi ada satu yang paling berarti. Jadi, di SMA saya ikut organisasi KIR. Dan dari sanalah saya menemukan passion saya dimana. Dan dari sanalah bakat saya benar-benar diasah, dikembangkan. Tak jarang saya menjadi perwakilan sekolah dalam mengikuti perlombaan tingkat Kabupaten, tapi hampir semuanya tidak bisa sampai tembus provinsi????selalu mentok di 3 besar saja. tapi saya nggak pernah menyerah untuk terus mencoba, mencoba dan terus mencoba. Sampai pada waktu itu Alhamdulillah bisa tembus nasional! Ya walau hanya dapet honorabel mantion. \r\n\r\nPokoknya di organisasi KIR saya benar-benar menemukan jati diri saya.',	1,	1655694335,	NULL,	0),
('SCHLR-FLCRG-8fbc65',	'USR-FLCRG-53b73',	'Felicia Regina ',	'2004-07-26',	'85781693501',	'Jl. Sumber rejeki no 18, Parigi Lama, Pondok Aren, Tangerang Selatan ',	'Administrative bussines ',	'6 Vocational high school ',	'3.00',	'6',	'Saya Felicia Regina, berumur 18 tahun, saya saat ini duduk di kelas 12,selama menjalani pendidikan saya aktif mengikuti berbagai organisasi di sekolah, sepertj PMR, pramuka, Tari Tradisional, dan organisasi perusahaan siswa, selain itu selama bersekolah di smkn 6 saya selalu menduduki peringkat 10 besar',	'Saya ingin menjadi seorang manajer ataupun sekretaris yang handal di masa depan selain itu saya juga ingin membuka usaha saya sendiri yang nantinya bisa membuka peluang kerja bagi mereka yang memang membutuhkan',	'Iya saya mengikuti organisasi di sekolah SMKN 6 Jakarta yaitu perusahaan siswa atau disebut student Company di sana saya belajar banyak mengenai cara menjalani perusahaan cara mengontrol biaya-biaya yang dikeluarkan dan saya juga belajar untuk harus bisa selalu bekerja sama dalam situasi apapun di student company sendiri kami membuat produk kami sendiri dengan tujuan membuat produk yang kreatif dan inovatif baik bentuk barang ataupun jasa di student company sendiri saya menjabat sebagai Vice President accounting jadi saya juga belajar bagaimana cara memanage keuangan dengan baik selama mengikuti student company juga saya dan tim saya mengikuti lomba dan beruntungnya Kami mendapatkan juara 2 tingkat wilayah kota dan juara 1 tingkat provinsi',	1,	1653569480,	NULL,	0),
('SCHLR-FLLSH-965395',	'USR-FLLSH-b9199',	'Fellashofa Regita Rahmalia',	'2002-04-10',	'85664303764',	'Paron, Ngawi, East Java \r\n',	'Ilmu Al Quran dan Tafsir Ushul',	'IAIN Ponorogo ',	'3.77',	'2',	'Saya seorang yang kreatif dan suka mencari alternatif solusi dari berbagai macam persoalan. Saya juga bersikap terbuka terhadap semua kemungkinan solusi yang ada. Kreativitas sangat membantu dalam pembentukan karakter dan fisik di masa mendatang serta untuk menjadi pemimpin yang baik karena dengan kreatifitas tersebut saya dapat mengantisipasi segala kondusi dan situasi.',	'Mimpi terbesar saya adalah memiliki bisnis mandiri yang akan saya muwudkan dengan permulaan proses kecil, sedikit dikit lama-lama menjadi bukit. serta dengan ketekunan pasti bisa mewujudkan mimpi tersebut.',	'Dalam berorganisasi saya pernah menjadi ketua gugus depan yang selalu memanage jalannya aktifitas dalam gugus depan saya waktu itu. selain itu dalam voulunteer saya pernah membantu dalam hal konsumsi panitia serta peserta, selain itu saya juga pernah berkecimpung dalam hal keagamaan dalam HMJ yang saya jalani saat ini. \r\n\r\nRelawan yang pernah saya jalani yaknin mengajar di suatu pondok selama satu tahun yang letaknya lumayan jauh dari peradaban kota. ',	1,	1654156271,	NULL,	0),
('SCHLR-FLXJN-7049a8',	'USR-FLXJN-b83c9',	'Felix Jonathan',	'2003-03-17',	'88216457660',	'Jalan Kukilomukti Nomor 158, Pedurungan Kidul, Pedurungan 50192, Semarang, Jawa Tengah',	'Fisika',	'Universitas Diponegoro',	'4.00',	'1',	'Saya Felix Jonathan (18 tahun) anak pertama dari 4 (empat) bersaudara, Kelahiran di Jakarta, dan kini menjalani program studi S1 Fisika di Universitas Diponegoro (angkatan 2021). Secara garis besar, hobi saya meliputi: membaca buku-buku yang berkaitan dengan STEM (science technology engineering and maths); filosofi; novel fiksi; dengan kecenderungan terbesar dalam ilmu fisika, menulis, berolahraga, dan menonton film-film atau video di youtube.\r\n\r\nSemenjak mulai menginjak masa SMA, saya mulai dikenali dengan ilmu fisika secara mendalam. Hal ini membuat sangat tertarik dengan ilmunya serta mengetahui bahwa di SMA saya ada klub Fisika, saya mengejar nilai saya supaya sempurna pada mata pelajarannya (merupakan kriteria penentuan masuk ke dalam klubnya). Hal ini kemudian berhasil saya capai. Setelah itu saya diikutkan dalam perlombaan-perlombaan fisika, pelatihan-pelatihan, dan sebagainya. Hal ini yang memantapkan saya untuk melanjutkan studi saya dalam jurusan Fisika di UNDIP ini.\r\n\r\nKini saya sedang menjalani studi di semester 2 (dua). Selain belajar, saya menghabiskan waktu saya dalam keseharian dengan membantu orang tua saya yang bekerja sebagai catering dan membuka toko makanan di GoFood dan GrabFood. Selain itu, saya juga memiliki pekerjaan sampingan yakni menjadi tutor les untuk anak-anak SMP dan SMA.',	'Seiringan dengan saya mulai mendalami ilmu fisika, saya sering melihat video-video dari TED, Big Think, webinar-webinar, dan berita-berita tentang isu global. Melihat tokoh-tokoh seperti Freeman Dyson, Chiara Marletto, Curtis Calland, Leonard Susskind, dll., yang berdiri dan bekerja di ujung ilmu pengetahuan manusia, memajukan, terus mengembangkan, dan menemukan inovasi-inovasi untuk menyelesaikan masalah-masalah global memberikan saya kesan bahwa saya ingin ikut menjadi seperti mereka. Sehingga impian terbesar saya secara umum yakni untuk menjadi seorang peneliti.\r\n\r\nSaya memahami bahwa lingkungan kita sangat memengaruhi bagaimana kita berkembang sebagai seorang individu. Oleh karena itu, saya mulai mengelilingi diri saya dengan orang-orang yang serupa. Dimulai dengan ikut komunitas-komunitas yang aktif dalam isu SDGs (impaakt), bergabung dalam server discord untuk belajar bersama dan bertukar pikiran, belajar tips-tips dari mahasiswa yang berkuliah di universitas-universitas \"ivy league\", meniru kebiasaan-kebiasaan (positif) orang-orang yang tercantum di atas, dan sebagainya.\r\n\r\nOleh karena keputusan yang saya buat tersebut, gaya hidup dan pola pemikiran saya pun terpengaruh. Saya mulai dikenali dengan gaya hidup produktif, growth mindset, active learning, \"hustle culture\", dan sebagainya. Dari hal itu saya juga banyak belajar mengenai dunia riset, apa saja tantangannya, sehingga saya mendapat gambaran mengenai \"saya harus seperti apa\" untuk mencapai impian saya. Saya menyadari bahwa impian saya relatif sulit untuk dicapai, tetapi biografi-biografi singkat para ilmuwan memiliki 1 sikap yang menjadi ciri khas seorang peneliti/ilmuwan, yakni pekerja yang sangat keras.',	'Pada SMA saya sempat menjabat menjadi bagian dari OSIS (sie IPTEK). Selama masa jabatan saya, sebagian besar kegiatan saya meliputi: mengatur mading (majalah dinding) sekolah; berkoordinasi dengan siswa-siswi yang tergabung dalam ekstrakulikuler menulis, mengadakan acara hunting foto di sekitar Semarang bersama dengan siswa-siswi yang tergabung dalam SKYLENZ (komunitas fotografer di SMA), menjadi penanggungjawab dokumentasi dan penyebarluasan informasi pada acara-acara yang diadakan baik oleh OSIS maupun oleh guru-guru.\r\n\r\nPada saat ini, sementara saya terlibat dalam beberapa kepanitiaan untuk acara-acara kemahasiswaan yang diadakan di univesitas saya. Saya menjadi panitia dalam acara lomba Diponegoro Physics Cup (DPC) sebagai sie akademik yang merupakan ajang perlombaan tingkat SD, SMP, SMA. Selama saya menjadi panitia dalam acara ini, sebagian besar kegiatan saya meliputi: membuat kisi-kisi, silabus, soal yang akan dilombakan, dan peraturan teknis yang akan diterapkan pada saat hari pelaksanaan lomba. Selain itu, saya bersama dengan divisi akademik juga berkoordinasi dengan divisi desain dalam perancangan website DPC bagi peserta untuk membaca informasi terkait pengumuman dan penjelasan akan acara yang akan berlangsung.\r\n\r\nSelain itu, saya juga menjadi panitia dalam acara LKMM-PD (Latihan Keterampilan dan Manajemen Mahasiswa tingkat Pra-Dasar) sebagai sie acara, yang merupakan acara pelatihan soft skill, komunikasi, serta pengenalan struktur serta fungsi organisasi dalam universitas bagi mahasiswa baru angkatan 2022. Sebagian besar kegiatan saya bersama dengan staff acara dalam kepanitiaan ini antara lain: merancang sebagian besar bagaimana acara ini berlangsung, mengurus anggaran dan proposal acara, membentuk dan mengatur bentuk penugasan serta teknis penilaian, dan sebagainya. ',	1,	1655542606,	NULL,	0),
('SCHLR-FNLCD-f46b0d',	'USR-FNLCD-45174',	'Fiona alicia adeleida wenas',	'2004-08-02',	'81218689415',	'Jl. Camar 1 Blok BT No. 20\r\nSektor 3, Bintaro',	'IPA',	'SMAK RICCI II',	'0.00',	'6',	'Saya merupakan anak ketiga dari tiga bersaudara. Saya merupakan orang yang tekun, pantang menyerah, percaya diri, suka memimpin, dan memiliki peruntungan yang besar. Hobi saya adalah mengikuti event seperti konser dan lainnya. Saya menyenangi bidang entertainment dan travel. Sedari kecil, saya sering mengikuti lomba-lomba khususnya di bidang bulutangkis dan meraih juara 3 sekota Jakarta Selatan. Saya juga pernah memenangi juara 1 (gold) dalam kompetisi paduan gereja (Pesparawi) seprovinsi Banten. ',	'Mimpi terbesar saya adalah ingin membanggakan Indonesia dan kedua orang tua saya. Untuk mewujudkan itu, langkah pertamanya saya akan mencoba berbagai beasiswa agar saya dapat kuliah tanpa membebani orang tua. Jika saya berhasil lolos, saya akan menjalani kuliah diselingi dengan organisasi yang akan membuat diri saya berkembang. Cita-cita saya lainnya adalah mengembangkan SDM Indonesia, karena saya menyadari betapa kayanya negeri kita, namun banyak dari kita yang tidak bisa mengolahnya. ',	'Saya merupakan anggota pramuka Kelas 4-6 SD. Telah mengikuti kegiatan Perjumsa hingga keluar kota. Dalam bidang olahraga, saya merupakan salah satu anggota PBSI (Persatuan Bulutangkis Seluruh Indonesia) dan aktif mengikuti Kejurkot (Kejuaraan Kota) hingga tahun 2017. Selain itu, saya aktif menjadi anggota dalam Paduan Suara Anak GPIB Filadelfia pada tahun 2017.',	1,	1654659101,	NULL,	0),
('SCHLR-FNTRY-b3a10a',	'USR-FNTRY-2863f',	'Fantria Yusri Adhitama',	'2003-06-16',	'895621065818',	'Kp. Bojong Tanjung RT 03 RW 25 Desa Sangkanhurip Kecamatan Katapang kabupaten Bandung Jawa barat ',	'Pendidikan IPS/FPIPS',	'Universitas Pendidikan Indones',	'3.94',	'2',	'Hallo Saya Fantria seorang mahasiswa yang sedang menempuh pendidikan di Universitas Pendidikan Indonesia semester 2 dengan mengambil program studi Pendidikan IPS. Saya mempunyai minat yang besar terhadap pendidikan maka dari itu saya berusaha untuk mengenyam pendidikan setinggi mungkin sehingga diharapkan saya mampu berkontribusi kepada negri dalam pendidikan juga. Selain kuliah saya juga disibukan dengan kegiatan beberapa organisasi yang sedang saya ikuti, kepanitiaan bahkan mengajar les private. Kelebihan saya yaitu Mampu management waktu, bekerja dibawah tekanan dan mampu mengadakan seminar atau Webinar bagi mahasiswa dan pelajar. Adapun kekurangan saya yaitu kurang percaya diri.',	'Mimpi terbesar saya yaitu dimana saya dapat membangun yayasan pendidikan dari tingkat TK-SMA gratis bagi orang yang tidak mampu serta dengan menyediakan program beasiswa bagi mereka yang berprestasi tetapi terkendala masalah biaya. Pada intinya saya ingin memajukan sistem pendidikan Indonesia agar mampu bersaing secara global dan seluruh masyarakat dapat merasakan pendidikan minimal sampai SMA dan maksimal sampai Perguruan tinggi. Selain itu saya ingin membuat inovasi media pembelajaran berbasis teknologi untuk peserta didik agar memudahkan penyampaian materi.',	'Ya tentu saja saya pernah mengikuti organisasi & Kepanitiaan sejak SMP-Kuliah diantaranya: saya pernah menjadi Staff divisi Mikat yang membuat proker perlombaan bagi seluruh siswa, Panitia perpisahan seluruh angkatan, panitia ldks selama 2 priode, Sekretaris organisasi MPS yang membuat ketentuan dan memperhatikan kinerja OSIS selama 2 priode, ketua pelaksana Rapat Besar, pernah menjadi BA online di 5 event, mengikuti social & education campaign di 15 event secara online, menjadi sekretaris di organisasi YLW dalam bidang kepenulisan, Staff Operation yang membuat kegiatan Webinar, seminar dan Talkshow serta staff Event Organizer membuat berbagai Webinar dan seminar kepada mahasiswa pelajar dan masyarakat. Panitia Himpunan UPI, Bendahara Kegiatan ILF, divisi acara kegiatan P2M, divisi Humas pada kegiatan Olimpiade IPS dan seminar guru nasional dan masih banyak lagi. Dengan berbagai pengalaman yang saya dapatkan ini sehingga saya mampu melatih soft skill dan hard skill saya.',	1,	1655353248,	NULL,	0),
('SCHLR-FQFDL-a87122',	'USR-FQFDL-b90b4',	'faiq fadlilah',	'2002-11-27',	'895807679100',	'jl kembangan desa paron kecamatan ngasem kabupaten kediri',	'PENDIDIKAN BIOLOGI  FAKULTAS M',	'UNIVERSITAS NEGERI SURABAYA',	'3.50',	'2',	'saya merupakan orang yang memiliki kelebihan dapat memanajemen waktu dengan baik, bertanggung jawab dan disiplin ilmu, saya juga memiliki kekurangan yaitu saya sering multitasking saya mengatasinya dengan melakukan meditasi untuk melatih fokus saya dan membuat to do list agar semua kegiatan saya bisa terlaksana dengan baik ',	'Kesadaran untuk terus membangun diri adalah titik awal sebuah kesuksesan,  mimpi terbesar saya saya pengen  dikenal banyak orang walaupun non formal maupun formal, saya pengen menjadi anak berprestasi, menjadi mc diajang acara yang besar. tpi saya sadar tidak mudah untuk mewujudkanya. langkah awal saya saat ini saya  mengikuti organisasi  kecil kecil di kampus saya, dan berbagai lomba harapan saya, saya ingin berkembang dalam melaksanakan hal tersebut dan dapat bermanfaat bagi orang banyak.',	'saya saat ini sedang bergabung di himawari unesa, dan mengikuti kepanitiaan pkkmb 2022 dan unesa art festival. di himawari unesa saya menjadi staff anggota divisi psdm dan pada kepanitaan pkkmb dan unesa arti festival saya menjadi sie  perlengkapan',	1,	1655716929,	NULL,	0),
('SCHLR-FRDFD-daa3ec',	'USR-FRDFD-b12fa',	'Fara difa adella',	'2002-11-13',	'82386687804',	'Jln kampung lalang ,rt 04/ rw.07, kelurahan air jamban, kecamatan mandau, kabupaten bengkalis ,riau',	'Farmasi',	'Universitas muhammdyah riau',	'3.75',	'2',	'Saya mahasiswa aktif universitas swasta, saya memiliki hobby membaca dan mempelajari hal\" baru , saya sangat suka bersosialisasi kepada masyarakat,  saya suka pergi kesuatu daerah baru dan mempelajari ilmu\" baru yang saya dapatkan disana ',	'Mimpi terbesar saya adalah dapat memanfaatkan ilmu dan skill yang saya miliki dengan mengembangkan ilmu tersebut kepada banyak orang, mimpi terbesar saya adalah dapat membantu banyak masyarakat dan memberikan mereka kebahagiaan , saya bermimpi untuk dapat memiliki usaha dan dapat bekerja di perusahaan besar . Cara saya mewujudkan mimpi saya adalah dengan mencari dan belajar ilmu\" baru yang saya miliki dapat membantu saya meningkatkan ilmu saya dan dapat saya bagikan kepada masyarakat . Mimpi terbesar saya adalah saya ingin menciptakan senyum untuk orang\" yang membutuhkan uluran tangan ',	'Saya tergabung di organisasi kampus saya yang bernama himafarm( himpunan mahasiswa farmasi) , saya juga sering menjadi relawan yang turun ke lapangan untuk meminta sumbangan kepada masyarakat untuk membantu masyarakat lain yg terkena musibah ',	1,	1654211586,	NULL,	0),
('SCHLR-FRDFD-ef4b36',	'USR-FRDFD-b12fa',	'Fara difa adella',	'2002-11-13',	'82386687804',	'Jln kampung lalang ,rt 04/ rw.07, kelurahan air jamban, kecamatan mandau, kabupaten bengkalis ,riau',	'Farmasi',	'Universitas muhammdyah riau',	'3.75',	'2',	'Saya mahasiswa aktif universitas swasta, saya memiliki hobby membaca dan mempelajari hal\" baru , saya sangat suka bersosialisasi kepada masyarakat,  saya suka pergi kesuatu daerah baru dan mempelajari ilmu\" baru yang saya dapatkan disana ',	'Mimpi terbesar saya adalah dapat memanfaatkan ilmu dan skill yang saya miliki dengan mengembangkan ilmu tersebut kepada banyak orang, mimpi terbesar saya adalah dapat membantu banyak masyarakat dan memberikan mereka kebahagiaan , saya bermimpi untuk dapat memiliki usaha dan dapat bekerja di perusahaan besar . Cara saya mewujudkan mimpi saya adalah dengan mencari dan belajar ilmu\" baru yang saya miliki dapat membantu saya meningkatkan ilmu saya dan dapat saya bagikan kepada masyarakat . Mimpi terbesar saya adalah saya ingin menciptakan senyum untuk orang\" yang membutuhkan uluran tangan ',	'Saya tergabung di organisasi kampus saya yang bernama himafarm( himpunan mahasiswa farmasi) , saya juga sering menjadi relawan yang turun ke lapangan untuk meminta sumbangan kepada masyarakat untuk membantu masyarakat lain yg terkena musibah ',	1,	1654211639,	NULL,	0),
('SCHLR-FRDNR-7861fc',	'USR-FRDNR-7565b',	'AFRIDA NOOR HANDAYANI',	'2001-05-27',	'85641754130',	'Margorejo RT 01 RW 10 kec Dawe Kudus Jateng ',	'PGSD',	'Universitas Muria Kudus ',	'3.76',	'4',	'Saya adalah seorang pemuda yang terbilang rajin, mandiri maupun penuh dengan tantangan. Saya senang mencari hal-hal yang baru dan saya termasuk orang yang bertanggung jawab dan berjiwa pemimpin.',	'Sesuai dengan jurusan saya PGSD, saya ingin menjadi guru yang profesional, kreatif, menyenangkan, sekaligus mendidik siswa nantinya agar menjadi pribadi yang baik dan bisa menjadi pemimpin yang bertanggung jawab.',	'Dikampus, saya mengikuti tiga organisasi. \r\nYang pertama yaitu BEM FKIP, saya merupakan departemen sosial dan kerohanian. Tujuan saya ikut di departemen tersebut, karena rasa peduli saya yang besar terhadap sesama masyarakat. Departemen itu mengajarkan saya untuk bisa berbagi atau membantu dengan semampunya.\r\nYang kedua yaitu organisasi Seni Kampus UMK. Disana saya belajar tentang seni musik, tari, perfilman dan juga rupa. Divisi yang saya ambil adalah seni tari dan sudah beberapa kali pentas di atas panggung.\r\nYang ketiga yaitu organisasi FORMI. Saya baru saja mengikutinya dan belum menjadi anggota tetap. Tetapi, saya pernah mengikuti program pembagian takjil selama sebulan disana.',	1,	1655095266,	NULL,	0),
('SCHLR-FRGNS-30048d',	'USR-FRGNS-35619',	'Firga Nisyar Ayomsari',	'2002-04-03',	'82243408699',	'Jalan Waringin 7 No. 129 Kec. Pangkah, Kab. Tegal, Jawa Tengah',	'Statistika ',	'Universitas Diponegoro',	'3.81',	'4',	'Saya merupakan orang yang growth oriented, dynamic, dan memiliki rasa ingin tahu yang besar. Saya memiliki minat yang sangat besar terhadap dunia analisis data dan saya juga sangat concern terhdapa dunia pendidikan. Hal tersebut mengantarkan saya untuk menempuh pendidikan dengan jurusan statistika dan saat ini saya menjadi mahasiswi Universitas Diponegoro tahun kedua. Saya memiliki harapan untuk menjadi salah satu pemuda yang dapat menginspirasi anak muda yang lain unutk terus mengembangkan rasa ingin tahunya. Saya juga berharap dapat memberikan kontribusi untuk mendukung pendidikan menjadi lebih baik melalui edutech. Selama kuliah, saya aktif mengembangkan diri dengan mengikuti berbagai volunteer, kepanitiaan, dan organisasi baik di dalam maupun luar kampus. Saya berharap dengan pengalaman dan pengetahuan saya tersbut, menjadikan saya kandidat yang tepat untuk beasiswa ini karena saya ingin mengembangkan diri saya melalui berbagai program yang beasiswa ini tawarkan.',	'Mimpi terbedar saya adalah bagaimana saya bisa mengaplikasikan pengalaman dan pengetahuan yang saya miliki untuk bisa berdampak dan menginspirasi bagi orang-orang sekitar. Dengan background yang saya miliki sebagai mahasiswi statistika, saya memiliki mimpi untuk bisa terjun di dunia analisis data, sebagai seorang ahli data yang bisa mempresentasikan melalui layout data yang dari situ bisa menghasilkan solusi yang tepat terhadap suatu permasalahan. Di sisi lain, saya juga sangat tertarik terhdap dunia pendidikan dimana saya ingin bisa memberikan  inspirasi dan kontribusi saya kepada anak-anak muda untuk terus bertumbuh. Untuk mecapai mimpi yang besar tersbut yang terpenting adalah mindset. Bagaimana mimpi itu bisa terkesan lebih konkrit. Mimpi yang besar tersebut bisa dipecah menjadi mimpi-mimpi yang lebih kecil yang rasa saya bisa capai hari demi hari, yang dari mimpi kecil tersebut bisa mencapi ke mimpi terbesar tadi. Oleh karena itu, saya memiliki rencana jangka pendek untuk mengembangkan potensi diri saya dan mengeksplor lebih dalam lagi bidang yang saya tekuni melalui berbagai kegiatan seperti organisasi, volunteer, kursus, membuat projek kecil, dan berinteraksi dengan banyak orang.',	'Saya aktif di salah satu organisasi kampus yaitu Diponegoro MUN Society sebagai Public Relations. Menurut saya, itu sangat menarik dan menantang karena dapat menambah wawasan tentang dunia dan melatih diri untuk bisa berpikir cepat dan terstruktur, bernegosiasi, berdiskusi, dan berbicara di depan khalayak umum. Selain itu, saya juga sangat senang mengikuti kegiatan kerelawanan, salah satunya Tegal Learning Center dan diamanahkan sebagai Public Relations. TLC merupakan salah satu yayasan yang begerak di bidang pendidikan dan bertujuan untuk membantu pendidikan di daerah-daerah. ',	1,	1655735482,	NULL,	0),
('SCHLR-FRHSY-2bc1b9',	'USR-FRHSY-776b5',	'Farah Syifa Putri Darmawan',	'2003-05-06',	'81383545261',	'Jl. Cempaka Warna No. 6 Cempaka Putih Timur, Cempaka Putih, Jakarta Pusat, DKI Jakarta 10510',	'Administrasi Bisnis',	'Universitas Diponegoro',	'3.78',	'4',	'Nama saya Farah, usia saya 19 tahun, saat ini saya sedang menempuh pendidikan pada semester 4 di Universitas Diponegori dengan jurusan Administrasi Bisnis. Saya memiliki nilai kumulatif yang cukup baik, saya juga dapat mengikuti perkuliahan secara lancar dan memenuhi tanggungjawab saya sebagai mahasiswa. Saya telah mengikuti beberapa kegiatan di kampus dan luar kampus. Saya sangat senang bersosialisasi karena saya merasa saat masih SMA saya kurang bersosialisasi sehingga kemampuan saya untuk berkomunikasi dan berinteraksi dengan banyak orang kurang baik yang sangat terasa pada saat menjadi mahasiswa baru dimana saya takut untuk mengeluarkan pendapat serta mencari teman. Namun dengan kegiatan yang telah saya ikuti, saya merasa bahwa kemampuan dalam berkomunikasi dan berinteraksi sudah lebih baik. Selain itu, saya juga merasa sangat senang dapat berkuliah dan menjadi seorang mahasiswa karena pemikiran saya jauh lebih terbuka dan dapat menilai suatu hal dari sudut pandang lain. Saya juga senang dapat berdiskusi dengan banyak orang mengenai hal-hal yang saya suka dan saya merasa saat berdiskusi terdapat isi dan hal yang dapat saya pelajari terlebih setelah menjadi mahasiswa dimana argumen yang dikeluarkan atau didapatkan sudah memiliki isi yang kuat berdasarkan hasil-hasil penelitian yang kita baca bukan hanya sekedar logika saja. Pada tahun 2021 saya menjadi bagian dari divisi hubungan masyarakat pada acara Business Plan Competition Administrasi Bisnis UNDIP, pada tahun yang sama saya juga menjadi Admin Officer pada acara yang diselenggarakan oleh Effion Creator School x Kominfo. Selain itu saya juga menjadi bagian dari divisi Marketing Communication pada acara Global Class Webinar Hubungan Internasional UNDIP. Lalu pada tahun yang sama, saya mengikuti kegiatan Pertukaran Mahasiswa Merdeka angkatan 1 dengan universitas penerima Universitas Mulawarman secara offline dan universitas tujuan yaitu Universitas Brawijaya, UPNVY dan UIR secara online. Pada tahun 2022, saya menjadi bagian dari divisi acara, koordinator Instagram serta pebimbing adik tingkat acara TEKA ADBIS 2022 dan saat ini saya juga menjadi bagian dari divisi Publikasi Dekorasi dan Dokumentasi acara Business Plan Competition Perception Administrasi Bisnis UNDIP 2022. ',	'Mimpi terbesar saya adalah membanggakan orang tua dengan memberikan yang mereka minta, seperti mendapatkan IPK diatas 3.5, mendapatkan beasiswa, mengikuti kegiatan perkuliahan dengan baik dan mengikuti beberapa kepanitiaan yang ada di kampus. Selain itu, membanggakan orang tua bagi saya adalah dengan mendapatkan pekerjaan yang baik, sesuai dengan minat dan bakat saya lalu dapat membantu perekonomian keluarga saya. Pekerjaan yang saya inginkan adalah menjadi auditor di bank karena saya tumbuh di lingkungan yang mayoritas bekerja di bank sehingga saya cukup familiar dengan hal tersebut, namun selain itu saya juga ingin bekerja di perusahaan start up. Cara saya mewujudkan semua itu adalah dengan berusaha untuk mengikuti pekruliahan dengan sungguh-sungguh, mencari informasi mengenai beasiswa dan kepanitiaan yang ada dan berusaha untuk mendapatkannya. Hal-hal tersebut juga menjadi cara untuk mendapatkan posisi pekerjaan di bagian yang saya sangat inginkan jadi cara-cara itu bekerja sama untuk mewujudkan banyak hal.',	'Pada tahun 2021 saya menjadi bagian dari divisi hubungan masyarakat pada acara Business Plan Competition Administrasi Bisnis UNDIP, disana saya bertugas untuk melakukan kerjasama dengan eksternal seperti akun media sosial, pembicara (menghubungi pembicara, memastikan dana untuk pembicara sudah sepakat dan diterima saat acara selesai, membantu pembicara dari pra acara sampai pasca acara) serta himpunan mahasiswa dari universitas lain. pada tahun yang sama saya juga menjadi Admin Officer pada acara yang diselenggarakan oleh Effion Creator School x Kominfo, disana saya bertugas untuk melakukan administrasi seluruh peserta dalam waktu 1 bulan, menjadi Master of Ceremony pada kegiatan pelatihan selama 1 bulan dan menjadi garda depan untuk menghadapi pihak eksternal. Selain itu saya juga menjadi bagian dari divisi Marketing Communication pada acara Global Class Webinar Hubungan Internasional UNDIP, disana saya mengurusi pihak eksternal dengan menjalin kerjasama dengan beberapa organisasi kampus lain, akun-akun sosial media (promoter), organisasi besar dan sebagainya. Lalu pada tahun yang sama, saya mengikuti kegiatan Pertukaran Mahasiswa Merdeka angkatan 1 dengan universitas penerima Universitas Mulawarman secara offline dan universitas tujuan yaitu Universitas Brawijaya, UPNVY dan UIR secara online. Pada tahun 2022, saya menjadi bagian dari divisi acara, koordinator Instagram serta pebimbing adik tingkat acara TEKA ADBIS 2022, disana saya mengurusi keseluruhan acara dari mencari tema, slogan, rundown, kegiatan acara, games, mengurus konten untuk sosial media (Instagram) TEKA ADBIS serta membimbing dan menjadi jalur komunikasi bagi kepanitiaan dan adik tingkat dalam kegiatan acara ini hingga selesai. Saat ini saya juga menjadi bagian dari divisi Publikasi Dekorasi dan Dokumentasi acara Business Plan Competition Perception Administrasi Bisnis UNDIP 2022, saya mengurus desain proposal, media partner hingga virtual background.',	1,	1654599190,	NULL,	0),
('SCHLR-FRNSS-89c592',	'USR-FRNSS-9577b',	'Fransiska Sri Utami',	'2002-06-25',	'85926041400',	'Lestari wonorejo puncu kediri',	'Ekonomi pembangunan/Fakultas E',	'Universitas Airlangga',	'3.63',	'2',	'Saya adalah mahasiswi semester 2 Ekomomi pembangunan Fakultas ekonomi dan bisnis universitas airlangga. Saya adalah seseorang yg ulet, semangat serta pekerja keras. Saya berasal dr keluarga yg sederhana orang tua saya seorang petani yg hanya menempuh pendidikan tingkat dasar namun orang tua selalu mensupport saya untuk mengenyam pendidikan di bangku kuliah dgn semangat dan support dr orang tua saya semangat dan pantang mundur untuk bisa membahagiakan orang tua',	'Membahagiakan orang tua dengan menjadi orang sukses dan bisa membantu orang2 di sekitar kita yg membutuhkan',	'Saya mengikuti organisasi koperasi mahasiswa FEB UNAIR sebagai staff kominfo dan saya juga mengikuti otganisasi ACSES FEB UNAIR sebagai Staff SCIENCE selain itu saya juga mengkuti kepanitiaan comunity deveploment dan abdi desa.',	1,	1654497944,	NULL,	0),
('SCHLR-FRSHD-758ed9',	'USR-FRSHD-06b4c',	'Farisah Idzni Nadhilah',	'2002-08-22',	'81398452242',	'Taman Puri Cendana A2 / 16. Jl anggrek, tambun selatan, bekasi, Jawa barat',	'PGSD',	'Unisma Bekasi',	'3.50',	'4',	'Saya adalah seseorang yang menyukai hal baru dan tantangan. Karena dari keduanya kita akan mendapatkan pengalaman, sebagaimana yang kita ketahui bahwa pengalaman ada guru terbaik. Saya memiliki ketertarikan dalam dunia pendidikan, maka saya akan berusaha untuk selalu berkontribusi dalam hal itu. Saya ingin dan selalu berusaha untuk menjadi orang yang bermanfaat. ',	'Mimpi terbesar saya yaitu dapat menjadi perwakilan negara dalam suatu event tertentu, serta mengikuti pertukaran pelajar. Saya juga bermimpi bahwa suatu saat nanti saya bisa menjadi narasumber dalam kegiatan yang peserta nya adalah para anak muda serta mengajar anak2 dipedalaman sana. Cara saya mewujudkannya yaitu, dengan saya belajar terus menerus , kemudian berani untuk keluar zona nyaman. Serta memiliki teman dan rekan yang dapat mendukung saya. ',	'Saya aktif organisasi dr sma dengan menjadi ketua bidang bahasa dan pendidikan. Kemudian ketika kuliah, saya menjadi bendahara dalam suatu organisasi. Pengalaman menjadi relawan belum pernah, namun saya memiliki sedikit pengalaman dalam mengajar. saya pernah magang di SD swasta daerah bekasi, serta menjadi guru les private. ',	1,	1654400228,	NULL,	0),
('SCHLR-FTHNB-31e951',	'USR-FTHNB-3f5ec',	'Fathan Abiyyu Pakarti Almay',	'2003-05-19',	'85329931457',	'Desa Karangwuluh, Kec. Kutoarjo, Kab. Purworejo Jawa Tengah',	'Pendidikan Biologi/Fakultas ke',	'Universitas Tidar',	'3.40',	'2',	'Perkenalkan nama saya Fathan Abiyyu Pakarti Almay, umur saya 19 tahun saya memiliki minat di bidang bisnis, sejak kecil saya di ajari tentang bisnis, saya pernah mengikuti workshop tentang enterpreneur\r\nSaat ini saya sedang menempuh kuliah di universitas tidar magelang pada prodi pendidikan biologi, karena saya ingin menjadi sesorang pendidik sekaligus seorang enterpreneur, saya menyadari bahwa mendapatkan gelar sarjana adalah sebuah keharusan untuk mewujudkan impian saya membutuhkan banyak uang. Saya tidak bisa meminta bantuan pada orang tua karena beberapa hal. Oleh karenanya saya disini untuk melamar beasiswa',	'Mimpi saya ingin menjadi seorang pendidik yang merubah sebuah mindset siswa menjadi growth mindset dengan menyisipkan tentang enterpreneur, cara saya dengan terus belajar dan mengikuti berbagai workshop tentang pendidikan dan enterpreneur, serta sedikit demi sedikit saya terapkan di kehidupan saya',	'Saya di SMA pernah mengikuti organisasi MPK dimana tugasnya sebagai pengevaluasi dan pengawas dari kinerja OSIS, saya sendiri sebagai ketua dalam organisasi tersebut',	1,	1655272871,	NULL,	0),
('SCHLR-FTHRN-cb55ba',	'USR-FTHRN-1ddae',	'Faathir Andar Nurali',	'2006-03-02',	'81382335732',	'Jl.H.Saaba NO.29, RT03/RW01, Joglo, Kembangan, Jakarta Barat 11640',	'IPS',	'MAN 12 Jakarta',	'3.3',	'2',	'Perkenalkan saya Faathir Andar Nurali, bisa dipanggil dengan Faathir. Saya sekarang mengenyam pendidikan di bangku sekolah MA Negeri 12 Jakarta, dengan jurusan yang saya ambil adalah ilmu pengetahuan sosial dan Kelas 10. Di lingkungan sekolah, saya sangat aktif terhadap organisasi ataupun ekstrakulikuler, contohnya, OSIS. Di organisasi OSIS  saya sangat aktif dan berkontribusi sekali atas acara-acara untuk memajukan sekolah saya, baik secara menyalurkan pendapat ataupun tenaga, di samping itu saya juga berfokus akan kemampuan diri saya seperti soft skill meliputi, public speaking, manajemen waktu, berpikir kritis.',	'saya memiliki mimpi untuk menjadi anggota dewan di indonesia, alasan saya ingin mimpi menjadi anggota dewan, adalah pada saat saya berkunjung ke gedung DPR RI Jakarta disana saya melihat dan mendengar para anggota dewan menyampaikan pendapat hasil dari reduksi pemikiran anggota dewan tersebut di salurkan ke sidang yang berlangsung, maka itulah yang melatar belakangi saya untuk memilih mimpi terbesar saya itu. Dengan mimpi yang besar itu, saya juga harus berusaha untuk dapat mewujudkan mimpi saya dengan baik, yaitu dengan terus menggali ilmu sebanyak banyaknya, ikut voluntering, ikut organisasi luar sekolah, ikut perlombaan lainnya, dan mencari beasiswa untuk menunjang pendidikan saya, itulah beberapa faktor untuk saya dapat mewujudkan impian saya. ',	'1. organisasi siswa intra sekolah = saya telah menjalankan program kerja yang bersangkutan dengan acara sekolah, sepeti clasmeet, pentas seni, bulan bahasa, dan lain sebagainya, dengan kontirbusi yang saya lakukan acara dari program kerja tersebut berjalan dengan sangat baik\r\n2. organisasi PMR = Di organisasi tersebut saya sedang menjalankan sebuah program kerja kemanusiaan tentang donor darah, dalam acara donor darah, saya harapkan potensi akan kemampuan saya dapat berkontribusi dan ikut andil dalamn acara iini, menjadi lebih baik dan lancar sukses',	1,	1655477392,	NULL,	0),
('SCHLR-FTMHZ-7f331e',	'USR-FTMHZ-db444',	'Fatimah Az Zahra',	'2001-12-29',	'82269238851',	'Jalan Kebun Bunga, Bukit Bunga Indah R5, RT 56 RW 007, km. 9, Palembang, Sumatera Selatan, Indonesia\r\n',	'Ilmu Hubungan Internasional FI',	'Universitas Sriwijaya',	'3.93',	'7',	'Nama saya Fatimah Az Zahra, biasa dipanggil Zahra. Mahasiswi semester 7 jurusan Ilmu Hubungan Internasional di Universitas Sriwijaya. Orang sekitar seringkali menyebut saya sebagai “enthuastic and self-driven learner”, di mana saya sendiri juga yakin bahwa saya merupakan individu yang selalu haus akan pengembangan diri dan memegang erat ‘improvement’ sebagai value atau nilai kehidupan mendasar yang saya percayai. Untuk menjadi versi diri yang menjadi aspirasi saya selama ini, saya merupakan individu yang sering terlibat dalam banyak pelatihan, program, dan juga kegiatan untuk mengembangkan kemampuan diri dengan lebih baik lagi. Setiap memiliki waktu luang dan keinginan/ketertarikan yang kuat untuk belajar hal baru, saya sering mendaftar berbagai program dan juga mengasosiasikan diri pada banyak sekali kegiatan. \r\n\r\nTak hanya itu, saya juga aktif dalam berbagai organisasi, mulai dari organisasi kepemimpinan bernama AIESEC, club mahasiswa bernama Model United Nations, English Debate Club, dan yang lainnya. Namun meskipun selalu \'haus\' untuk kegiatan eksternal yang dapat membantu saya untuk mengasah kemampuan diri, saya juga masih dapat mengimbangi kehidupan akademik kuliah saya. Alhasil, saya tetap mampu mempertahankan IPK 3.93/4.00 sampai semester 7 saat ini.',	'Mimpi terbesar saya saat ini adalah belajar di universitas ternama luar negeri, baik melalui exchange program ataupun mengambil Master\'s Degree atau S2 di masa depan. Untuk mewujudkannya pasti memperlukan persiapan yang matang. Saya memulai dengan fokus dalam English Proficiency Test yakni IELTS atau TOEFL iBT. Saya berencana untuk mengikuti kursus gratis atau mencari beasiswa yang dapat membantu saya secara finansial demi dapat mengambil salah satu EPT tersebut. Saya juga sering mendaftarkan diri dalam program mentoring session dengan para awardee yang telah berkesempatan belajar ke luar negeri. Tak hanya itu, saya juga sudah mulai merencanakan skema kegiatan berorientasi pada dampak untuk negeri yang dapat menjadi nilai applause ketika saya mendaftar pada program studying abroad.',	'Ya. Saya banyak mengikuti organisasi. AIESEC, Model UN Club, Debate Club, dll. Namun saya paling fokus pada AIESEC, sudah 2 tahun+ menggali pengalaman di organisasi kepemimpinan global ini. Saya juga memiliki pengalaman kepanitiaan dan relawan dalam beberapa proyek sosial, layaknya menjadi panitia relawan dalam proyek Greenesia 2.0 dari AIESEC UNSRI (proyek berdasarkan SDG nomor 12: Climate Action yang mengajarkan anak anak SMP mengenai pentingnya kelestarian lingkungan hidup demi iklim yang stabil).',	1,	1655742822,	NULL,	0),
('SCHLR-FTMHZ-ee94cf',	'USR-FTMHZ-c167e',	'Fatimah Azzahra',	'2005-06-17',	'82314706011',	'Kalisat RT 001/RW 007, Dsn. Rejosari, Kec. Bancak, Kab. Semarang, Jawa Tengah, Indonesia',	'MIPA',	'MAN 1 SEMARANG',	'3.66',	'4',	'Hai saya seorang siswa SMA kelas 11 di MAN 1 SEMARANG. Di sekolah saya mengambil kelas unggulan boarding, sehingga saya berada di lingkungan sekolah selama 24 jam. Selain aktif dalam pembelajaran sekolah formal saya juga aktif dalam pembelajaran asrama. Saya aktif dalam organisasi PKM di sekolah dan  juga pengurus asrama OSBHI. Saya juga sering diikut seratakan dalam bernagai lomba, olimpiade, dan menjadi pembawa acara dalam sekolah maupun luar sekolah. Setiap seminggu sekali saya mengikuti program kelas unggulan khusus yaitu kelas unggulan matematika. Oleh karena itu saya sering mengikuti olimpiade matematika baik resmi dari pemerintahan ataupun dari lembaga-lembaga.',	'Saya ingin mahir dalam public speaking serta berbahasa inggris. Saya selalu berusaha memperhatikan, antusias, dan aktif dalam pembelajaran bahasa inggris. Selain itu saya juga belajar secara mandiri dalam melatih soeakung saya. Termasuk saya sering melihat vidio pembelajaran, speech, debat, ataupun public speaking melalui media youtube, twitter, instagram atau melihat secara langsung dalam acara lomba kebahasaan.',	'Saya saat ini menjabat sebagai sekretaris di 2 organisasi yang berbeda. Yang pertama yaitu organisasi Patroli Keamanan Madrasah (PKM). Yang kedua yaitu Organisasi Siswa Boarding School Hubbul Ilmi. Keduanya saya sama-sama menjabat sebagai sekretaris.',	1,	1653710975,	NULL,	0),
('SCHLR-FTMLD-4094a2',	'USR-FTMLD-1b096',	'Fatima eldituszahra',	'2002-08-01',	'82285480184',	'Jln. Anas Karim No.41 Rt.01 Kel. Kampung Manggis, Kec. Padang Panjang Barat, Padang Panjang, Sumatera Barat, Indonesia',	'Administrasi Publik/ Fisip',	'Universitas Andalas',	'3.82',	'2',	'Aku adalah anak pertama dari 3 bersaudara. Aku anak perempuan satu-satunya di keluargaku. Aku memiliki 2 orang adik laki-laki, yang masih berusia kurang dari 10 tahun. Mama ku meninggal 16 Agustus 2021 kemaren. Jadi sekarang aku tinggal dengan papa dan 2 orabg adikku',	'Mimpi terbesar ku bisa dapet beasiswa skolah keluar negeri dan melanjutkan kuliah ku sampai S3. Bisa membahagiakan papa dan adik\" ku. Cara ku mewujudkan nya yaitu dengan rajin belajar dan ikut banyak program beasiswa',	'Aku baru pernah ikut kepanitiaan acara jurusan ku di kampus.. Posisi ku disana yaitu dibagian divisi sponsorship',	1,	1654143046,	NULL,	0),
('SCHLR-FTNCH-37f312',	'USR-FTNCH-8831e',	'Fatina Chaerunnisa',	'2004-05-16',	'85862687694',	'Perumahan Lido Permai, Block C 5 No.11 Kecamatan Cigombong, Kabupaten Bogor',	'Otomatisasi Tata Kelola dan Pe',	'SMK WIKRAMA BOGOR',	'8.00',	'6',	'Saya seorang siswi SMK WIKRAMA BOGOR jurusan OTOMATISASI TATA KELOLA DAN PERKANTORAN dengan pengalaman kerja lapangan selama 6 bulan, saya menguasai beberapa aplikasi microsoft dan aplikasi google. Di pengalaman magang saya, tugas utama saya adalah merekap data, mengelola microsoft office & excel, mengelola google dokumen, mengikuti kursus pelatihan, dan mengatur acara online. Saya sangat menyukai hal yang baru yang dapat memperluas pengetahuan saya.',	'1. Membangun mesjid yang mempunyai fasilitas yang nyaman dan bagus untuk tempat ibadah, membangun sekolah yang menunjang bagi anak anak untuk melakukan aktivitas belajar - mengajar.\r\n\r\n2. Membuat orang tua bangga dengan membelikan barang yang ia mau dengan hasil kerja keras kita. \r\n\r\nDengan cara konsisten belajar dan bekerja keras dalam mencapai sesuatu.',	'1. OSIS - SMPIT ALHUSNA - 2018\r\n- Menjabat sebagai seksi kebudayaan\r\n- Bertugas menyampaikan materi tentang budaya\r\n- Membuat event pentas seni sekolah\r\n\r\n2. Organisasi Pendaki Sabtu Minggu\r\n 2019 -  2020\r\n- Menjabat sebagai seksi peralatan\r\n- Mengkoordinasikan barang barang persediaan\r\n- Melakukan aktivitas memilah sampah\r\n- Membuat laporan hadir anggota\r\n\r\n3. TEATER KERTAS - 2021 - \r\nSMK WIKRAMA BOGOR\r\n- Menjadi peran utama dalam pentas\r\nseni\r\n- Kerja sama dalam tim\r\n- Lomba Cerpen Nasional\r\n- Berlatih vokal dan gestur\r\n\r\n4. ',	1,	1653561035,	NULL,	0),
('SCHLR-FTNCH-f96cca',	'USR-FTNCH-2fbd8',	'Fatin Chasyla Aliyya',	'2003-10-27',	'85603706483',	'Jati Kulon rt02 rt02',	'Gizi',	'Universitas Diponegoro',	'8.96',	'1',	'Saya adalah mahasiswa program studi gizi di Universitas Diponegoro. Saya masuk di Universitas Diponegoro melalui jalur Seleksi Bibit Unggul Berprestasi (SBUB) tahun ini menggunakan sertifikat kejuaraan karya tulis ilmiah yang saya ikuti semasa SMA. Saya merupakan lulusan MA NU Banat Kudus, salah satu sekolah swasta yang telah bersertifikat ISO. Sejak SMA, saya aktif mengikuti organisasi dan kegiatan yang bermanfaat seperti penelitian dan jurnalistik.',	'Mimpi terbesar saya adalah menjadi salah satu peneliti di lembaga riset Indonesia atau LIPI. Maka dari itu, saya berusaha untuk selalu berprestasi di akademik dan juga bergabung di organisasi dan komunitas yang bermanfaat, selain menambah ilmu, saya juga dapat menambah relasi dan pengalaman. ',	'Selama berada di bangku sekolah, saya berusaha aktif dalam kegiatan berorganisasi, beberapa organisasi yang saya ikuti diantaranya adalah OSIS, pramuka, jurnalistik, dan klub karya tulis ilmiah. Saat menjadi pengurus, saya selalu berusaha menjalankan tugas saya dengan sebaik mungkin, selain itu saya juga beberapa kali mengemukakan pendapat saya ketika berdiskusi.',	1,	1655687100,	NULL,	0),
('SCHLR-FTRCH-d905b1',	'USR-FTRCH-c66df',	'Fitri Cahyani Siregar',	'2001-07-10',	'895321705588',	'Kp. Gerogol, Jl. Samudera Jaya RT 04/02 No. 19, Rangkapan Jaya, Pancoran Mas, Depok',	'Kesehatan Masyarakat',	'Universitas Airlangga',	'3.92',	'4',	'Saya merupakan anak ketiga dari 3 bersaudara. Saya merupakan lulusan SDN Depok Jaya 1, SMPN 18 Depok, dan SMAS Al-Hasra. Saat ini saya sedang menempuh semester 4 di Fakultas Kesehatan Masyarakat Universitas Airlangga. Saya merupakan orang yang rajin, pekerja keras, dan sangat ingin membantu kedua orangtua saya baik dalam hal fiinansial maupun hal lain.',	'Mimpi terbesar saya adalah bisa membahagiakan kedua orangtua say dengan membalas jasa-jasa yang telah mereka berikan kepada saya. Maka dari itu, saya ingin menjadi orang yang sukses. Cara saja mewujudkannya pastinya dengan tiada hentinya belajar, rajin beribadan, dan yang paling penting adalah selalu ingat bahwa semua sudah diatur oleh Yang Maha Kuasa.',	'Saat di SMA organisasi yang pernah saya ikuti hanya 1, yaitu sekretaris di kegiatan ekstrakulikuler bulutangkis. Namun ketika di PT saya mengikuti banyak organisasi/kepanitiaan serta beberapa relawan. Organisasi yang saya ikuti di PT yaitu BEM Fakultas dan Himpunan Mahasiswa (HIMA). Kemudian kalau kepanitiaan saya mengikuti di semua tingkat, seperti tingkat universitas, fakultas, dan prodi. Terakhir, kegiatan relawan yang pernah saya ikuti adalah Relawan BidikMisi Mengajar.',	1,	1653836609,	NULL,	0),
('SCHLR-FTRNL-3e9437',	'USR-FTRNL-e01b2',	'Fitriani Aulia Rizka',	'1993-03-07',	'85240550667',	'jalan Lingkar Sasayya, BTN Griya Hana Lestari, KEc. Bissappu, Kab. Bantaeng, Sulsel',	'Ilmu Komunikasi Jurusan Sosial',	'Universitas Indonesia Timur',	'3.90',	'2',	'Saya seorang ibu rumah tangga, ibu dari 2 putra yang juga aktif di bidang jurnalistik. Mengelola satu media online, mengelola sebuah blog pribadi dan rumah belajar gratis khusus untuk perempuan-perempuan di sekitarku yang ingin menempa diri menjadi pribadi yang lebih berkualitas, aktif dan berdedikasi.',	'Mampu memotivasi dan menumbuhkan rasa percaya diri kepada setiap individu yang terjebak dalam pikiran-pikirannya sendiri sehingga enggan melangkah dan berbuat lebih. Saya mewujudkannya dengan aktif mengadvokasi lewat media dan literasi, juga menyediakan sarana belajar gratis yang bisa tatap muka maupun tatap maya.',	'Saya masuk dalam keanggotaan seumur hidup di Mahasiswa Pencinta Alam dan Seni Budaya MAESTRO FBS UNM. Saya pernah jadi relawan saat meliput banjir bandang Bantaeng 2020. Saya relawan di dunia pendidikan dengan membuka Rumah Diskusi Redaksi Baru Institut, sarana belajar gratis yang juga bisa diakses lewat media sosial pribadi saya.',	1,	1654660732,	NULL,	0),
('SCHLR-FTRNV-978f0c',	'USR-FTRNV-a71be',	'Fitri Novia Rizka',	'2003-11-25',	'82337503104',	'Desa Rejosari RT 01 RW 01 Kec Belitang Mulya Kab Ogan Komering Ulu Timur',	'Paikologi',	'Stipsi jogja',	'3.50',	'2',	'Saya percaya bahwa saya layak mendapatkan beasiswa ini karena saya  memiliki rencana karir yang cukup jelas untuk kedepannya selain itu juga saya ingin membangun beberapa platform belajar bagi anak-anak yang kurang mampu untuk memudahkan anak yang berada didaerah terpencil karena saya sendiri sudah merasakan betapa sulitnya menempuh pendidikan didaerah yang sulit mengakses internet dengan melalui beasiswa ini sangat memberikan kesempatan bagi saya untuk menuntut ilmu yang lebih relevan untuk mencapai cita-cita saya dan saya akan berkomitmen dengan sungguh-sungguh dalam menjalani pendidikan ini agar kelak saya mampu membalas kepada pihak yang sudah mendukung saya serta memberikan dampak positif untuk lingkungan disekitar saya.',	'Cita-cita saya sejak kecil ingin menjadi seorang psikolog hal itu dibuktikan dari umur 11th saya sudah tertarik dengan berbagai macam buku novel yang berunsurkan psikologi.syarat untuk menjadi seorang psikolog pun harus menempuh pendidikan minimal S1 dan mengambil profesi psikologi minimal 1th namun pada awalnya ortu saya tidak setuju dengan cita-cita saya tapi saya bertekad dan yakin jika saya serius ingin menjadi seorang psikolog lalu th 2021 saya lulus SMA dan mengikuti tes perguruan tinggi berkat tekad serta kerja keras saya diterima di salah satu universitas dijogja dengan jurusan psikologi. Saya berharap lewat beasiswa ybb foundation ini saya bisa mewujudkan impian saya menjadi seorang psikolog ternama.',	'Saya memiliki ketertarikan khusus pada bidang it,pramuka,dan pmr.untuk itu saya mengikuti bebebrapa kegiatan yang berkaitan dengan minat tsb. Pada th 2017 saya mengikuti organisasi pramuka sebagai sekretaris lalu pada th 2018 saya mengikuti organisasi pmr sebagai sekretaris juga dan th 2020 saya mengikuti organisasi it dan mendapatkan penghargaan sebagai leadership terbaik hingga kini.untuk itu saya berkontribusi sepenuh hati dalam beberapa organisasi tsb dan dengan kontribusi tsb saya berhasil mendapat sertifikat ternama dari beberapa pelatihan yang saya ikuti diantaranya dari kominfo.',	1,	1654767814,	NULL,	0),
('SCHLR-FTRRH-577be0',	'USR-FTRRH-59840',	'Fitri Rahmalia Raharjo',	'2003-11-17',	'87785667088',	'Rawa Lumbu Sepanjang Jaya',	'MBTI FEB',	'Telkom University',	'3.84',	'2',	'Saya adalah orang yang gigih dan tidak mudah menyerah kelebihan saya adalah mudah beradaptasi, gigih dan sangat optimis dalam hal apa pun. Untuk kekurangan saya sendiri saya termasuk ke dalam pribadi yang teledor dan pelupa. Untuk mengatasi hal tersebut saya menandakan acara/deadline di kalender saya agar saya selalu mengingatnya untuk keteledoran sendiri saya mencoba mengatasi kekurangan saya dengan bersikap berhati -hati. Personality dari tes MBTI saya adalah ENTP.',	'mimpi terbesar saya adalah saya harap saya dapat bekerja di luar negeri dan juga dapat memberikan ilmu yang bermanfaat bagi orang lain. Cara saya mewujudkan mimpi tersebut adalah saya mulai mempelajari skill yang akan dibutuhkan ke dalam pekerjaan dan saya juga telah membangun personal branding saya sebagai SEO content writer ataupun copywriter dan saat ini saya sedang melakukan intern di adconomic walaupun saya masih semester 2 saya yakin saya dapat menyeimbangi para intern lainnya yang umurnya di atas saya. Dan untuk mewujudkan mimpi saya tersebut adalah saya mulai mengasah skill dan memperbanyak pengalaman dan tentunya saya kursus bahasa inggris di lia Bekasi untuk berbahasa asing dengan lancar agar dapat bekerja di luar negeri.',	'ya saya memilikinya  mulai dari kelas 1 SMA sampai saat ini \r\n\r\n-saya adalah wakil ketua divisi media dan jurnalistik yang bertugas untuk mengorganisir dan juga membuat konten untuk murid sekolah \r\n-saya adalah redaktur majalah faaza di SMA albinaa yang bertugas untuk membuat artikel dengan tema apapun dan majalah tersebut telah dipublikasikan\r\n-Saya adalah volunteer di finance for teen sebagai blog writer yang bertugas untuk membuat artikel, mengeditor artikel teman dan artikel tersebut di publikasikan di website finance for teen\r\n-Saya adalah pengajar di house of welcome yang bertugas untuk mengajar anak-anak di daerah dan membuat kurikulum yang akan dipelajari anak-anak\r\n-Saya adalah SEO content writer di adconomic yang bertugas untuk membuat artikel SEO caption produk instagram dan copywriting lainnya\r\n\r\npengalaman tersebut seluruhnya saya jalani dengan sangat senang karena saya memang menyukai bidang kepenulisan dan menurut saya hal yang paling menantang adalah ketika saya menjadi pengajar di house of welcome karena ada beberapa murid yang tuli dan saya belajar menggunakan bahasa isyarat untuk mengajari mereka.\r\n',	1,	1654923932,	NULL,	0),
('SCHLR-FZTLM-2a890c',	'USR-FZTLM-c93c2',	'Faizatul Mukaromah',	'2002-08-23',	'82236279403',	'Jl. Madura No 19 belakang dealer suzuki surya indah 001/002 Mimbaan,Panji -Situbondo, Jawa Timur',	'Teknik Informatika/Sistem Info',	'Universitas Negeri Surabaya',	'3.78',	'2',	'Saya lahir di situbondo salah satu kota yang mungkin asing bagi penduduk luar kota. Saya sadar bahwa saya harus terus maju untuk meraih cita cita dan dalam perjalanan itu tentu tidaklah mudah ada lika likunya tetapi saya harus terus bangkit dan berjalan dengan tegap. ketika ada hal dalam perjalanan cita cita saya yang saya harapkan tidak sesuai saya pasti sedih namun setelah itu saya lihat dari sudut pandang lain dan merevisi diri saya sendiri apa kekurangannya lalu bangkit dan memperbaiki diri dan tetap konsisten mengejar cita cita saya, itulah diri saya dimana menggunakan prinsip \"let it flow\"',	'Saya bermimpi untuk bekerja di bidang sesuai kemampuan saya sendiri dan spesifikasi yang saya miliki saya wujudkan itu dengan berkuliah sesuai bidang yang saya impikan tetapi dalam kuliah ini saya usahakan dengan sungguh sungguh dalam artian tidak membebankan orang tua saya',	'Saya waktu sma menjadi ketua salah satu ekstrakurikuler yaitu bulutangkis. Tentu dalam posisi itu yang saya hadapi tidaklah mudah saya harus menyusun laporan dan menyerahkannya ke osis lalu memberi arahan kepada para anggota ekstra dan tetap memberikan rasa nyaman agar anggota tidak keluar begitu saja dari ekstrakurikuler lalu berdiskusi oleh guru pembina ekstra tentang jalannya ekstrakurikuler. Selain itu pada bulan februari kemarin saya ikut organisasi daerah para mahasiswa situbondo yang kuliah di surabaya untuk mengadakan sosialisasi ke sma sma di situbondo. 2 kegiatan itu yang mengasah kemampuan public speaking saya. Di kampus saya ikut ukm musik juga dan tampil untuk mengurangi rasa ketakutan jika berhadapan di publik',	1,	1654147642,	NULL,	0),
('SCHLR-GBRNC-786f7b',	'USR-GBRNC-83cb5',	'Gibran Chafid Abdullah',	'2002-02-12',	'82135319301',	'Ds. Bakalan Rt.03 / Rw.01, Kec. Kandeman, Kab. Batang',	'S1-Teknik Sipil / Fakultas Tek',	'Universitas Jendral Soedirman',	'3.25',	'4',	'Berasal dari kota kecil di jawa tengah dengan lingkungan dimana teman-teman jarang yang melanjutkan jenjang pendidikan hingga kuliah. Namun, saya memiliki tekad untuk melanjutkan belajar di perkuliahan dengan dukungan pemuh dari orangtua. Keserdahanaan saya sebagai orang desa untuk menginjakan kaki di kota purwokerto guna menimba ilmu akan tetap ada, di samping banyak teman kuliah yang bisa dikatan lebih tampil bergaya. Awalnya merasa minder, tapi saya tetap ingat tujuan awal saya untuk mencari ilmu disana. Dengan humor dan pembawaan ringan yang saya tampilkan, bersyukur hal tersebut sukses membuat saya bisa bergaul dan memiliki banyak teman. Kuliah di teknik sipil bagi saya berat, benar seperti rumor yang diisukan banyak orang dan saya mengalaminya sendiri. Walaupun berat dan hampir saja menyerah dengan berbagai kesibukannya, saya tetap berusaha bertahan karena satu alasan yaitu orangtua. Saya ingin membahagiakan mereka dengan kesuksesan kelak. Tak terasa 4 semester hampir berlalu, semoga tahun kedepannya akan berjalan lancar dan sesuai harapan.',	'Sebenarnya sederhana saja akan tetapi kadang saya merasa belum siap untuk itu. Mimpi saya hanya ingin menjadi orang yang dapat menghasilkan manfaat dari bidang keahlian saya, bisa melihat orang dipermudah dan memiliki kehidupan baru karena inovasi yang saya berikan, hal itu sudah cukup memberi kepuasan di hati saya. Karena menurut saya setinggi-tinggi ilmu yang orang miliki jika dia tidak bisa menerapkan untuk kemaslahatan dan kepentingan masyarakat akan sama saja seperti dia orang yang tak berilmu. Cara saya untuk mewujudkan hal itu ialah salah satunya dengan menekuni belajar bidang keahlian yang saya miliki yaitu teknik sipil, disisi lain saya juga mencari teman, kenalan dan relasi sebanyaknya serta menjalin silaturahmi yang baik dengan mereka. Sebab, tentu kita butuh banyak peran dan bantuan orang lain untuk saling bantu membantu mewujudkan impian masing-masing. Saya juga sangat senang apabila ada kegiatan bakti sosial dari kampus maupun organisasi, saya berpartisipasi dan belajar juga disitu tentang cara bagaimana menghargai dan memperlakukan sesama manusia.',	'Dari awal semester 2 saya mengikuti keanggotaan mapala univeraitas, yaitu UPL MPA UNSOED. Disana saya belajar banyak hal, dari bagaimana hidup di alam, mencoba berbagi olahraga outdoor yang memacu adrenalin, juga saya disana dilatih untuk berorganisasi tentang bagaimana membuat rencana perjalanan, laporan hasil rapat, perancangan anggaran dan seperti apa langkah untuk memimpin dan bagaimana sikap ketika di pimpin. Di mapala juga diajarkan bagaimana cara menjaga alam, melestarikannya dan merawatnya. Kegiatan kemanusiaan di mapala juga tidak kalah gencarnya dari bakti sosial kesehatan, panitia vaksin untuk masyarakat, ada juga relawam untuk bencana alam dan rescue untuk laporan kehilangan orang di hutan atau sungai. Selain di mapala saya juga mengikuti UKM futsal dan sepakbola di fakultas teknik sebagaimana untuk menyalurkan hobi yang saya miliki.',	1,	1655379341,	NULL,	0),
('SCHLR-GHNBB-7e66ab',	'USR-GHNBB-2d89d',	'Ghina Abbiyah',	'2003-02-15',	'89627025506',	'Pringsewu, Lampung ',	'Ilmu kesehatan masyarakat/kese',	'Universitas Sriwijaya ',	'3.92',	'2',	'Saya Ghina Abbiyah umur 19 tahun. Saya seorang mahasiswa semester 2 jurusan ilmu kesehatan masyarakat di Universitas Sriwijaya. Saya memiliki ketertarikan di bidang human capital yang mendorong saya untuk mengikuti organisasi dan masuk divisi PSDM. Saya memiliki minat di bidang social service yang menjadikan saya beberapa kali terlibat dalam kegiatan kemanusiaan. Saya ingin memperluas pengalaman saya melalui beasiswa ini, mengingat beasiswa ini menawarkan banyak program yang menunjang untuk meningkatkan kemampuan dalam diri saya. ',	'Mimpi terbesar saya adalah menjadi bermanfaat bagi orang lain. Cara saya mewujudkannya adalah dengan meningkatkan kemampuan yang ada dalam diri saya melalui pembelajaran akademik dan mengasah soft skill yang saya miliki. Dalam hal ini, sesuai dengan jurusan kuliah saya, saya dapat memulai dengan berpartisipasi dalam peningkatan kualitas kesehatan masyarakat dimulai dari lingkungan yang terdekat dengan saya. ',	'Tahun 2018, saya pernah menjadi salah satu relawan untuk korban tsunami di Lampung. Saya dan tim menggalang dana untuk disalurkan secara langsung ke korban bencana. Dalam 1 hari, kami mengumpulkan uang sekitar Rp2.200.000,00 beberapa bahan sembako maupun pakaian layak pakai. ',	1,	1655665729,	NULL,	0),
('SCHLR-GHNML-91bdc6',	'USR-GHNML-bad97',	'Ghina Amaliana',	'2004-07-06',	'85641388191',	'JL. Peni No.58 Bina Griya Indah, Kel. Pringrejo, Kec. Pekalongan Barat, Kota Pekalongan.',	'MIPA',	'SMA N 4 Pekalongan',	'8.86',	'Lulus SMA,',	'Nama saya Ghina Amaliana, saya biasa dipanggil Ghina. Sekarang saya berusia 17 tahun. Saya berdomisili di Pekalongan dan baru saja lulus dari SMA N 4 Pekalongan. Alhamdulillah di masa SMA saya memiliki prestasi kejuaraan tim dalam bidang olahraga. Saya juga menjadi bagian dari Rohis SMA saya sebagai koordinator departemen seni dan budaya. InsyaaAllah saya adalah orang yang bertanggungjawab serta mampu beradaptasi dengan cepat. Keadaan dunia yang selalu berubah membuat saya terus belajar untuk mampu beradaptasi karena dengan hal itu insyaaAllah membuat saya menjadi lebih survive di dunia kerja nanti dan mampu memaksimalkan jaringan dengan baik. Saya memiliki ketertarikan yang besar di dunia pendidikan dan bisnis, oleh karena itu saya sedang mengikuti seleksi masuk perguruan tinggi dengan mengambil program studi pendidikan matematika. ',	'Saya bermimpi untuk memperbaiki pendidikan Indonesia, menjadi pengajar yang handal dan profesional sekaligus dapat membagikan ilmu-ilmu yang saya dapatkan kepada generasi penerus bangsa berikutnya, karena kunci utama dari segala hal adalah pendidikannya. Selain itu saya juga berusaha untuk menyelesaikan hafalan Al-Qur\'an saya serta dapat mengamalkan isinya di kehidupan sehari-hari. Mimpi tersebut akan saya wujudkan dengan hal-hal kecil yang dapat membuat diri saya menjadi lebih baik sebelumnya seperti jujur, amanah, bertanggungjawab, dapat memanfaatkan waktu sebaik mungkin sehingga dapat menjadikan saya orang yang berintegritas. Saya akan bertaqwa kepada Allah, berbakti kepada kedua orang tua, berdoa sekuat mungkin serta berusaha untuk gigih, tekun, dan mencari pengalaman di masa perkuliahan sehingga saya dapat belajar dari pengalaman-pengalaman saya.',	'Alhamdulillah semasa SMA saya diberikan amanah sebagai koordinator departemen seni dan budaya organisasi rohis. Pengalaman yang saya dapatkan selama mengikuti rohis adalah merasa membuat saya lebih dekat dengan Allah, lebih mengenal Islam, memperluas ilmu agama saya, belajar untuk berdakwah, memperbanyak relasi khususnya lingkungan baik yang menularkan kebaikan-kebaikannya kepada saya, peduli kepada sesama, mengembangkan bakat, serta menambah pengalaman yang sebelumnya belum saya ketahui. Saya dan anggota rohis lainnya saling bekerja sama mewujudkan beberapa proker salah satunya seperti Ramadhan Festival yang di mana proker ini dilaksanakan pada bulan Ramadhan yang diisi dengan lomba-lomba, seperti kaligrafi, nasyid, ceramah, dan masih banyak lainnya sehingga para peserta dapat berkontribusi dalam proker tersebut sekaligus mengembangkan minat dan bakatnya.',	1,	1655718527,	NULL,	0),
('SCHLR-GHNRH-cc97d0',	'USR-GHNRH-2646c',	'Ghina Rahimah',	'2002-03-16',	'89523428897',	'Jalan Sumatra Blok Dt 15 Jatiasih, Bekasi 17426',	'Program Studi Teknologi Pangan',	'Universitas Sultan Ageng Tirta',	'3.50',	'4',	'Nama saya Ghina Rahimah. Saya lahir di Jakarta pada 16 Maret 2002. Saya merupakan anak ke 3 dari 4 bersaudara. Ayah saya telah pensiun 3 tahun lalu dan ibu saya bekerja sebagai Staf Administrasi di Pusat Pendidikan dan Pelatihan Kebakaran, namun 2 tahun lagi beliau juga akan pensiun. Saat ini saya tinggal di Kota Bekasi dan merantau untuk Kuliah di Universitas Sultan Ageng Tirtayasa. Saya tengah menempuh perkuliahan semester 4 di Program Studi Teknologi Pangan. Semasa SMA saya memiliki minat di jurusan IPA serta kegiatan yang ada di Laboratorium. Oleh karena itu, saya memanfaatkan apa yang sudah saya pelajari semasa SMA dengan melanjutkan kuliah di program studi Teknologi Pangan. Program studi bidang ini sangat sesuai dengan rasa ingin tahu saya mengenai pangan. Program studi yang saya pelajari sekarang memiliki prospek kerja yang luas, disamping itu saya juga memiliki cita-cita untuk membuka sebuah industri pangan, mengingat lulusan Teknologi Pangan juga memahami produksi pangan dengan kualitas dan sanitasi yang baik, sehingga lulusan Teknologi Pangan bisa membuka sebuah usaha yang dapat menciptakan lapangan pekerjaan, hal ini sebagai bentuk kontribusi dan pengabdian saya kepada masyarakat sekaligus membantu menjaga ketahanan pangan yang ada di Indonesia dengan cara meningkatkan produksi pangan lokal. \r\nSaya merupakan mahasiswa yang aktif mengikuti organisasi dan program untuk pengembangan diri. Saya pernah mengikuti organisasi Himpunan Mahasiswa Teknologi Pangan (HIMAGIPAN) dan 2021 lalu saya mengikuti Program yang diadakan oleh Kemendikbud yaitu Pertukaran Mahasiswa Merdeka Dalam Negeri (PMM-DN). Tidak berhenti sampai disitu, saya aktif mendaftar program yang akan di ikuti di semester ini. Saat ini saya sedang mendaftar program volunteer yang akan saya ikuti saat liburan semester nanti, sehingga ketika libur saya bisa memanfaatkan waktu saya untuk pengembangan diri sekaligus melakukan bakti sosial kepada masyarakat. Sambil menunggu program volunteer, pada liburan ini saya juga sudah menabung untuk mengikuti kursus bahasa inggris (TOEFL/IELTS) di kampung inggris, hal ini saya lakukan karena banyak sekali impian yang ingin saya capai namun terhambat dengan kemampuan bahasa inggris saya yang kurang. Hal ini sebagai motivasi bagi saya untuk belajar lebih giat lagi. Salah satu impian saya di semester selanjutnya yaitu lolos seleksi program pertukaran pelajar luar negeri (IISMA), maka dari itu saya akan belajar dan terus belajar berbahasa inggris untuk meraih impian-impian saya. ',	'Saya memiliki cita-cita untuk mengimplementasikan ilmu yang telah saya dapat selama kuliah, yaitu membangun sebuah industri pangan. Saya ingin membuat suatu produk inovasi pangan lokal untuk membantu menjaga ketahanan pangan serta megenalkan masyarakat mengenai pangan lokal yang bisa dimanfaatkan oleh masyarakat. Maka dari itu, saya ingin belajar dan merealisasikan secara langsung dilapangan. Berorientasi dari cita-cita saya, saya mewujudkannya dimulai dari mengembangkan softskill berwirausaha. Di Himpunan Mahasiswa Teknologi Pangan saya menjabat sebagai sekretaris biro kewirausahaan. Saya belajar banyak mengenai kewirausahaan di organisasi tersebut. Selain itu, ketika saya semester 2, saya pernah bekerja sebagai pramuniaga di sebuah cafe sekaligus membuka sebuah usaha online shop melalui platform Instagram dan Shopee. Selain karena ingin membantu meringankan beban orangtua, saya juga memiliki rasa ingin tau bagaimana memulai sebuah usaha sebuah franchise atau café dan ingin belajar bagaimana mengelola keuangan. Saat SMP dan SMA saya pernah beberapakali memulai usaha namun gagal. Hal ini menjadi batu loncatan bagi saya untuk belajar mengenai entrepreneur. Maka saat ini bidang Entrepreneur adalah passion sekaligus cita-cita saya yang selalu ingin saya pelajari.',	'Saya aktif mengikuti kepanitiaan saat di organisasi Himpunan Mahasiswa Teknologi Pangan (HIMAGIPAN), Di Himpunan Teknologi Pangan saya menjabat sebagai Sekretaris biro Kewirausahaan. Saya banyak belajar ketika diposisi sekretaris biro kewirausahaan. Saat menjadi sekretaris, saya turut membantu kepala biro kewirausahaan untuk menyusun program kerja serta mengevaluasi dan memperbaiki program kerja periode sebelumnya, mengkoordinasi, monitoring, membuat notulensi setiap rapat dan kegiatan, serta membuat laporan pertanggungjawaban.  \r\nSaya mengikuti beberapa kepanitiaan di organisasi HIMAGIPAN. Di event Kunjungan Industri, saya mencalonkan diri untuk menjadi ketua pelaksana ke PT. Yakult Indonesia Persada, karena saya merasa mampu bertanggung jawab mengemban sebagai ketua pelaksana. Selain itu, di program kerja Upgrading dan Kaderisasi saya menjadi anggota dari seksi acara. Karena telah memiliki pengalaman sebagai anggota dari seksi acara, maka di program kerja selanjutnya yaitu Latihan Kepemimpinan (LK) saya dipercaya untuk menjadi koordinator seksi acara untuk mengatur segala rangkaian acara. Ketua Himpunan saya juga merekomendasikan saya sebagai delegasi salah satu event BEM FAPERTA. Di program kerja Hari Pangan saya menjadi anggota humas untuk mengkomunikasikan segala bentuk informasi kepada publik, klien yang bekerjasama di event dan investor sebagai sponsor dalam event yang di selenggarakan. Saya juga mengikuti kepanitiaan di program kerja Musyawarah Besar dan di amanahkan untuk menjadi PDD (Publikasi, Dekorasi dan Dokumentasi). \r\nDari rangkaian kepanitiaan yang sudah saya sebutkan diatas, saya belajar banyak tentang bagaimana kerjasama dalam team dan juga belajar public speaking. Karena ada di beberapa event saya harus memimpin jalan nya rapat dan beberapa kali saya dipercaya menjadi MC. Selain itu saya juga perlu melakukan briefing kepada narasumber atau pemateri, sehingga saya harus bisa komunikasi dengan menggunakan bahasa yang baik. Dari pengalaman-pengalaman saya, saya merasa mampu bertanggung jawab terhadap kegiatan dan program yang saya ikuti. Maka, dengan mengikuti program Beasiswa Youth Break the Boundaries saya akan berkomitmen untuk bertanggung jawab dan memanfaatkan sebaik mungkin kesempatan yang saya dapat.',	1,	1655680798,	NULL,	0),
('SCHLR-GHNYF-a80b4b',	'USR-GHNYF-d15a6',	'aghniya fathaniah putri rinaldhi',	'2004-01-06',	'8996995459',	'Graha keandra ciperna blok c 03 kecamatan talun kabupaten cirebon kode pos 45171',	'Multimedia',	'Smkn 1 Kedawung',	'8.36',	'6',	'saya aghniya fathaniah putri rinaldhi berasal dari Smk Negeri 1 Kedawung Jurusal Multimedia. Saya siswi kelas 12 yang baru saja lulus. selama di sekolah saya mengikuti banyak kegiaan ekstrakulikuler hingga kepanitiaan. Walaupun saya aktif kegiatan di dalam dan di luar sekolah saya tetap menjalankan kewajiban saya sebagai siswa yaitu belajar dengan nilai akhir semester 6 yaitu 86.40 dan rata-rata nilai keseluruhan yaitu 83.60. prestasi terakhir saya yaitu medali emas POSN olimpiade matematika 2022, emas POSN olimpiade informatika 2022, 10 besar nasional dari 60 pendaftar short movie dokumenter tingkat nasional yang diselenggarakan olah universitas budi luhur.',	'impian terbesar saya adalah bisa memiliki tempat les atau pendidikan gratis bagi yang kurang mampu dan memiliki bakat di bidang multimedia yang berisi pendidikan animasi, editing, coding, dan masih banyak lagi. cara mewujudkanya adalah dengan menempuh pendidikan saya terlebih dahulu, lalu saya membuat planing seperti perencanaan, bugeting, pemasaran, dan lainnya. lalu saya coba merekrut beberapa relawan untuk membuat tim. mengapa relawan? karena pendidikan ini gratis dan tanpa ada bayaran. kecuali terdapat donatur yang memberikan kepada kita. lalu kita mulai memasarkan produk ke sekolah sekolah maupun sosial media. lalu kita mulai pendidikan kita secara gratis bagi yang kurang mampu.',	'saya pernah mengikuti organisai KKR (Kader Kesehatan Remaja) sebagai ketua organisasi. di organisasi ini saya mengikuti banyak kegiatan diantaranya mengikuti penanaman mangrove, kemah ramah tamah lingkungan di sanggar lingkungan hidup, kegiatan filtrasi dan hidroponik di sekolah, event clean up beach di pantai kejawanan cirebon, dan BASAH SLUR (Bank Sampah Sedulur)',	1,	1655045403,	NULL,	0),
('SCHLR-GHNZN-5c458b',	'USR-GHNZN-bbd29',	'Ghina Zain Sukmaningrum',	'2001-10-28',	'85888803881',	'Tobratan RT 6, Wirokerten, Banguntapan, Bantul, Daerah Istimewa Yogyakarta, 55194',	'Teknologi Industri Pertanian ',	'Universitas Gadjah Mada ',	'3.37',	'4',	'Saya adalah mahasiswa jurusan Teknologi Industri Pertanian di Universitas Gadjah Mada. Saya senang belajar hal baru dan membaca untuk menambah wawasan. Saya mengikuri beberapa organisasi dan pernah mengikuti kepanitiaan di kampus untuk meningkatkan soft skill. Saya sangat tertarik dengan kegiatan sosial, kegiatan pengembangan diri, dan berkontribusi untuk masyarakat sekitar. ',	'Mimpi terbesar saya adalah ingin menjadi pengusaha sehingga dapat memberikan kontribusi yang positif bagi lingkungan. Impian saya tersebut belum fokus dsn detail karena saya masih membutuhkan bimbingan untuk mewujudkannya. Usaha yang saya lakukan yaitu dengan belajar sungguh-sungguh dan meningkatkan soft skill untuk mejadi bekal saya untuk dapat mewujudkan impian saya. ',	'Organisasi yang pernah saya ikuti seperti Koperasi Mahasiswa UGM dan pernah menjadi bagian dari Tim CSR, saya belajar untuk peduli terhadap masyarakat skeitar, kerja sama tim, dan berkontribusi untuk organisasi. Tergabung dalam Keluarga Mahasiswa Muslim Teknologi Pertanian (KMMTP UGM) untuk mendapatkan lingkungan yang baik, di sini saya belajar untuk bertanggung jawab, melatih public spekaing skill, dan masih belajar untuk mengembangkan leadership skill. sebagai staff di Divisi Media dan Informasi SEMA FTP UGM untuk mengasak kreativitas saya dan mengisi waktu luang dengan hal yang bermanfaat. ',	1,	1655735726,	NULL,	0),
('SCHLR-GHSSB-7ac859',	'USR-GHSSB-bf109',	'Aghis Sabili',	'2002-01-09',	'82218542373',	'RT1/RW4 desa Randuagung, Kec. Randuagung, Kab. Lumajang, Jawa Timur',	'Teknik Komputer',	'Politeknik Negeri Jember',	'3.14',	'4',	'Saya adalah seorang mahasiswa yang lebih suka mengeksplor pengetahuan dan hal hal baru secara mandiri diluar apa yang ajarkan oleh kampus. Lebih banyak pengalaman dan jalan yang saya pahami untuk mempersiapkan karir saya setelah kuliah nanti sebab saya banyak mengikuti webinar, pelatihan dan program pemerintah yang menunjang pengalaman saya sesuai bidang yang saya tempuh. Kemandirian hidup dan kepemimpinan diri selama kuliah saya bangun sedini mungkin karena keadaan ekonomi orang tua saya yang kurang baik sehingga menjadikan saya lebih termotivasi dan fokus pada setiap menit yang saya lalui selama kuliah. Saya memiliki tujuan untuk mengambil beberapa beasiswa dan pelatihan guna menjadi bekal sebagai calon lulusan yang akan membukakan peluang kerja baru bagi banyak orang terkhusus dibidang IT dan bisnis. Oleh karena itu, saya merasa layak untuk mendapatkan beasiswa yang ada sebagai salah satu penopang kemandirian kuliah saya serta bekal untuk menjadi diri yang lebih baik dan berguna dimasa mendatang.',	'Mimpi terbesar saya adalah membangun satu peluang kerja yang bisa membantu banyak orang agar dapat hidup lebih baik lagi terutama di daerah Jawa Timur dengan membangun agency freelance maupun start up sesuai bidang yang saya tempuh.',	'Saya hanya pernah mengikuti organisasi keagamaan baik di sekolah maupun di pesantren dan pernah membawa pulang sebuah piala ketika ada festival musik religi ketika SMA di tingkat kabupaten.',	1,	1655737630,	NULL,	0),
('SCHLR-GHTSN-e77df2',	'USR-GHTSN-bc6a9',	'Ghoitsa Anbar',	'2003-06-16',	'0882003430681',	'Dusun Kauman RT 3 RW 5 kecamatan Boja Kabupaten Kendal',	'Ekonomi Islam',	'Universitas Diponegoro',	'0.00',	'0',	'Saya anak ke 3 dari 5 saudara orang tua saya bekerja sebagai pedagang di pinggir jalan saya harap saya dapat membantu orang tua saya dengan mengikuti beasiswa ini.',	'Saya ingin menjadi pengusaha sukses maka dari itu saya memilih jurusan ekonomi agar menambah pengetahuan saya tentang bisnis, jika saya sudah sukses nanti saya akan membantu orang yang kurang mampu seperti saya.',	'Saya menjadi pengajar di SD Muhammadiyah, dan saya menjadi divisi bahasa dalam organisasi sekolah.',	1,	1654233213,	NULL,	0),
('SCHLR-GNGFR-03dae5',	'USR-GNGFR-4076d',	'Agung Afrizal',	'2003-08-22',	'82259662154',	'Jalan Muradi, RT 04 RW 00, Desa Koto Dua, Kecamatan Pesisir Bukit, Kota Sungai Penuh, Jambi.',	'Statistika',	'Universitas Diponegoro',	'3.74',	'2',	'Saya Agung Afrizal, sehari-hari biasa dipanggil Agung. Merupakan anak ke-3 dari 3 bersaudara. Hidup di keluarga yang religius dan tegas, karakter saya dibentuk sejak dini untuk selalu belajar dan menimba ilmu. Saya sedang menempuh pendidikan di Universitas Diponegoro pada program studi Statistika. Saya merupakan pribadi yang menganggap rintangan sebagai tantangan yang harus ditaklukkan dan menjadi pribadi yang lebih baik kedepannya.',	'Mimpi terbesar saya tentu ingin membahagiakan kedua orang tua yang sudah merawat serta mencintai saya dari lahir, sehingga tidak ada lain yang bisa saya lakukan untuk membalas budi kebaikan kedua orang tua selain membahagiakan mereka. Tentunya sangat banyak cara agar kedua orang tua bahagia, salah satunya ialah menjadi pribadi yang sukses di masa depan. Untuk menjadi sukses dibutuhkan jalan yang panjang dan kerja keras. Tentu bagi saya, belajar yang rajin, mempelajari banyak hal, serta mendekatkan diri pada Yang Maha Kuasa menjadi perjuangan saya selama ini serta yang akan selalu saya lakukan hingga akhir hayat.',	'Saat SMA tahun 2019 saya menjabat sebagai Sekretaris PMR di SMA saya. Sangat banyak pengalaman yang saya jumpai. Saya senang ketika sebuah bantuan menjadi sangat berarti bagi orang lain. Sehingga memutuskan untuk mengikuti organisasi kepalangmerahan. Diperlukannya pengetahuan dan pengalaman untuk menolong sesama manusia, sadar bahwa keaktifan dalam berorganisasi dapat mengasah kemampuan dalam kepemimpinan dan manajemen waktu, rasa\r\nsukarela serta kerja sama dalam membantu orang lain. Saya dipercaya menjadi Sekretaris PMR tahun 2019, dan merupakan sebuah kehormatan untuk menjalakan jabatan tersebut. Jabatan tersebut menjadi jembatan untuk mengenal hal-hal baru terutama dalam bidang administrasi.',	1,	1655626609,	NULL,	0),
('SCHLR-GNGHL-36c16b',	'USR-GNGHL-37dd8',	'Agung Ahlul Wicaksana ',	'2001-02-27',	'85741347283',	'Pulosari 02/02 Sroyo, Jaten, Karanganyar ',	'Ilmu Gizi / Fakultas Ilmu Kese',	'Universitas Muhammadiyah Surak',	'3.55',	'6',	'Perkenalkan nama saya Agung Ahlul Wicaksana, saya Lahir pada tanggal 27 Februari 2001 dan juga anak tunggal dari pernikahan Wijiyanto S. Ag dan E. Widarsi Susilowati. Hobi saya yakni gemar membaca buku dan suka menulis walau masih pemula. Saya memiliki motto hidup yakni jadilah mata air mengalir yang mampu memberikan kehidupan di sekitarmu. Alasan saya mengambil motivasi itu karena saya ingin menjadi seseorang yang mampu memberikan perubahan dan bermanfaat untuk orang lain/makhluk lain serta terinspirasi juga dari kisah nyata Prof. B. J. Habibie. Selain itu juga, saya ketika luang memiliki hobi basket dan tim favorit saya yakni Pelita Jaya dan Celtics serta Warriors',	'Mimpi terbesar saya yakni bagaimana agar saya mampu menjadi seseorang yang membawa perubahan dan ingin menghidupkan kembali esensi dari Ilmu itu sendiri kepada masyarakat hingga mampu diaplikasikan. Jurusan yang saya impikan memang salah satunya Ilmu Gizi, dan mimpi saya yakni memberikan suatu edukasi dan inovasi akan pangan yang baik dan halal serta membuat/membantu dalam kontribusi sistem penjamin makanan yang baik dan halal. Caranya yakni dengan melakukan riset kecil-kecilan untuk mengamati dan menganalisis hal yang diperlukan dalam suatu inovasi baik dari bahan dll disekitar sehingga mampu terpahamkan —tidak hanya saya sendiri— namun juga masyarakat',	'Ya saya memiliki pengalaman organisasi. Saya pernah menjalani organisasi Ikatan Pelajar Muhammadiyah (IPM)  selaku Ketua Bidang Perkaderan di Daerah Surakarata, Jawa Tengah pada tahun 2019-2021 dan Anggota Perkaderan Pimpinan Wilayah IPM Jawa Tengah tahun 2021-2023. Pada bidang itu, saya mempelajari bagaimana menentukan dan memformulasikan metode untuk membuat sumber daya manusia yang berkualitas sesuai dengan ketentuan di IPM. Selain itu juga, saya juga pernah menjabat selaku Ketua Umum Pimpinan Komisariat Ikatan Mahasiswa Muhammadiyah Fakultas Ilmu Kesehatan. Pada posisi saya menjabat selaku ketua umum,saya memahami bagaimana cara mengorganisir suatu kelompok/organisasi dan menjadi problem solver ketika menghadapi masalah yang dihadapi oleh setiap anggota',	1,	1653473356,	NULL,	0),
('SCHLR-GNSLM-d3ff26',	'USR-GNSLM-675cd',	'Gina Salma Auliya',	'2004-07-14',	'85724321350',	'Permata Harjamukti Selatan Rt.004/015,Kelurahan Kalijaga,Kecamatan Harjamukti,Kota Cirebon,Jawa Barat',	'MIPA',	'SMAN 3 CIREBON',	'8.5',	'6',	'Saya adalah seorang siswa yang baru lulus SMA pada bulan Mei 2022 lalu.Salah satu skill yang saya miliki adalah kemampuan untuk memimpin.Saya mampu memimpin sebuah kelompok atau organisasi dengan baik.Saat di sekolah,saya sering ditunjuk sebagai ketua kelompok dalam mengerjakan tugas dan berhasil menyelesaikan tugas dengan hasil yang maksimal.Selain itu,saya pernah menjadi ketua sangga pada acara TTCT pramuka,serta menjadi wakil ketua divisi pada suatu organisasi.Berbeda dengan minat,saya memiliki minat yang tinggi pada bidang komunikasi dan sosial.Hal tersebut berawal dari kegiatan kerewalanan yang sering saya ikuti hingga sekarang.Kegiatan kerelawanan dan organisasi yang saya ikuti saat masih sekolah,memberi saya pengalaman untuk bekerja secara efisien sehingga saya memiliki kemampuan manajemen waktu yang baik.',	'Mimpi terbesar Saya adalah ingin menjadi menteri sosial di Indonesia.Karena Saya memiliki jiwa sosial yang tinggi,serta Saya mengalami sendiri bagaimana rasanya lahir di tengah kondisi ekonomi yang kurang mampu.Saya ingin mengentaskan masalah kemiskinan di Indonesia,meningkatkan kesejahteraan hidup rakyat Indonesia,serta memberikan pemberdayaan kepada rakyat Indonesia agar menumbuhkan SDM dengan kualitas tinggi sehingga mampu bersaing dengan negara maju,dan menjadikan Indonesia Emas 2045 sebagai negara maju yang sejahtera.\r\nUntuk bisa mewujudkan mimpi tersebut,Saya memulainya dari hal sederhana.Dengan aktif dikegiatan sosial atau kerelawanan,itu sudah menjadi langkah kecil untuk bisa mewujudkan mimpi Saya.Saya juga bercita cita untuk melanjutkan pendidikan S1 Saya pada tahun ini di Universitas Gadjah Mada,jurusan Pembangunan Sosial Dan Kesejahteraan.Saya harap dengan mengambil jurusan tersebut Saya bisa lebih optimis untuk menjadikan mimpi Saya jadi nyata dan ilmu yang Saya pelajari bisa diimplementasikan untuk mengemban amanah sebagai seorang Menteri Sosial.Dan Saya juga sangat berharap bisa menjadi awardee Beasiswa YBB tahun ini,untuk membantu meraih mimpi besar Saya.',	'Saya memiliki banyak sekali pengalaman kerelawanan dan organisasi.Hal tersebut dimulai sejak Saya kelas 10 semester 2,atau saat mulai sekolah daring.Selama sekolah daring Saya merasa ruang gerak Saya sangat terbatas,akhirnya Saya berinisiatif mencari cari info di instagram tentang kegiatan relawan dan organisasi.Beberapa kegiatan relawan dan organisasi yang pernah saya ikuti adalah :\r\n1. Ekstrakurikuler Teater,menjabat sebagai bendahara \r\n2.Organisasi Moksamerta,menjabat sebagai wakil ketua divisi PSDM dan mendapat penghargaan sebagai wakil ketua divisi terbaik \r\n3.Organisasi MindTheGap,menjabat sebagai staff divisi scriptwriter \r\n4.Relawan Clean Up Beach bersama seluruh siswa/i dari Kota atau Kabupaten Cirebon,diselenggarakan oleh organisasi CirebonPeduliLingkungan\r\n5.Relawan Generasi Bebas Plastik,diselenggarakan oleh organisasi Generasi Bebas Plastik yang bekerjasama dengan IndoRelawan\r\n6.Relawan kampanye nasional \"Ayo Jaga Lingkungan Kita\",diselenggarakan oleh organisasi AkuPeDuLi\r\n7.Relawan sebagai mental health advocate,diselenggarakan oleh organisasi Comma.ID\r\n8.Ketua Sangga TTCT Pramuka tahun 2019',	1,	1655453774,	NULL,	0),
('SCHLR-GNSLT-d475c2',	'USR-GNSLT-03ca4',	'Ganies Ultifa Anum',	'2001-12-02',	'895339500481',	'Jalan Krukut H. Jaip No: 51 Rt: 006/ Rw: 01 Kec. Limo, Kota Depok, Jawa Barat',	'Sosial Ekonomi Perikanan',	'Universitas Brawijaya',	'3.68',	'4',	'Saya adalah seorang mahasiswa aktif semester 4 di Universitas Brawijaya. Saya memiliki kemampuan memimpin dalam sebuah organisasi. Dengan jiwa kreatif dan inovatif yang saya punya, membuat diri saya merasa menajadi manusia berkualitas di Kuliah. Tentunya dengan kelebihan yang saya miliki, saya senang membantu sekitar dan khususnya lingkungan terdekat saya.',	'Mimpi terbersar saya adalah, saya ingin menjadi bos dan memiliki usaha dibidang kuliner. Saya ingin sekali memperkerjakan banyak orang untuk menjadi team atau karyawan saya. Cara mewujudkannya, saya harus mengetahui manajemen setiap langkah kecil didalam sebuah restoran. Dimulai dengan hal sederhana, saya menjadi karyawan disebuah resto sehingga saya memiliki pengalaman dan bekal untuk saya gunakan kedepannya.',	'Ya, saya seorang mahasiswa yang aktif dalam organisasi. Jika saya menggeluti sesuatu saya pasti akan memberikan 100% isi pikiran atau ide-ide yang membangun untuk menjadikan sebuah program kerja yang menarik dan berhasil. Dengan jiwa kreatif dan inovatif yang saya miliki, saya mendapat penghargaan Staff Ahli Kemenkoan Terbaik EKM Universitas Brawijaya pada bulan Juli 2021. Hal itu, membuat saya terharu dan bangga terhadap diri sendiri.',	1,	1655732030,	NULL,	0),
('SCHLR-GSTLN-e78aac',	'USR-GSTLN-405a7',	'I Gusti Lanang Prastawan Adithya Putra',	'2002-01-19',	'88703035073',	'Lingkungan Desa, Kelurahan Subagan, Kecamatan Karangasem, Kabupaten Karangasem, Provinsi Bali',	'Manajemen Sumberdaya Perairan ',	'Universitas Brawijaya',	'4.00',	'4',	'Perkenalkan nama saya I Gusti Lanang Prastawan Adithya Putra, saat ini saya sedang menempuh perkuliahan di Universitas Brawijaya semester 4 di Fakultas Perikanan dan Ilmu Kelautan jurusan Manajemen Sumberdaya Perairan. Saya cukup aktif dalam kampus, pernah menjadi staff divisi BSI Olahraga tahun 2020, untuk saat ini saya menjadi wakil Dewan Perwakilan Umum di salah satu UKM yaitu Unikahidha. Saya sangat senang dalam berorganisasi karena saya bisa mempraktekkan ilmu yang saya peroleh selama kuliah, harapannya dengan pengalaman tersebut saya bisa memberikan kontribusi untuk masyarakat',	'Mimpi terbesar saya yaitu bisa bermanfaat bagi masyarakat terutama yang berada di tempat saya tinggal sekarang. Saya sangat tertarik dengan hal-hal yang berbau lingkungan, untuk dapat mewujudkannya yaitu pastinya belajar lebih giat lagi lalu mendatangi masyarakat agar mengetahui apa masalah-masalah yang dihadapi sehingga bisa untuk memecahkan masalah tersebut. Selain itu dengan melatih skill seperti public speaking juga bisa mewujudkan mimpi tersebut dan harapannya melalui program beasiswa tersebut saya bisa melatih skill saya dan bisa mewujudkan mimpi saya sedikit demi-sedikit',	'Pengalam berorganisasi yaitu saya sempat menjadi staff di departemen BSI Olahraga yang pada saat itu saya menjadi penanggung jawab di bidang olahraga futsal. Saat menjalani program kerja tersebut terdapat beberapa kendala seperti peminat yang ikut futsal masih saling berjauhan, tidak boleh kumpul beramai-ramai karena masih dalam situasi pandemi covid-19, jadi untuk program kerja latihan rutin masih terkendala. Saya berinisiatif untuk membuat konten berupa video dasar-dasar bermain futsal lalu mempostingnya di media sosial dengan harapan dapat ditonton oleh semua orang termasuk para peminat olahraga futsal.',	1,	1654005243,	NULL,	0),
('SCHLR-GVNNW-c2ba07',	'USR-GVNNW-01e9d',	'Giovanni Owen',	'2003-12-20',	'81211721447',	'Bekasi, Jawa Barat',	'Kedokteran Hewan',	'Universitas Udayana',	'3.73',	'2',	'Nama aku Owen, asal dari Bekasi tapi sekarang sedang berkuliah di Universitas Udayana Bali. Saya berkuliah di Jurusan Kedokteran Hewan, dari kecil saya suka sekali dengan hewan dimulai pada saat ibu saya memberikan saya menonton Nat Geo dari situlah saya mulai tertarik dengan hewan liar dan akuatik. ',	'Bekerja di Australian Zoo dibagian Aquatic Animals. Cara mewujudkannya yang pasti dengan mendapatkan nilai yang bagus pada setiap mata pelajaran dan saya harap bisa mengambil S2 di Australia',	'Dari SMP-SMA selalu ikut OSIS. Pada saat ini saya menjadi bagian dari DPM FKH UNUD atau dewan perwakilan mahasiswa di fakultas saya. Dari organisasi ini saya mendapat banyak hal yang berguna bagi hidup saya',	1,	1653823046,	NULL,	0),
('SCHLR-HDNKH-7a2ed3',	'USR-HDNKH-6aa50',	'Hudan Akhsani Taqwim ',	'2001-06-01',	'85736010938',	'Jl. Dr Cipto Blok F no. 5 Perum Pondok Indah Btn Kolor Rt. 06 Rw. 09 Kecamatan Kota Sumenep Kab.sumenep Kode pos 69415.',	'Informatika',	'Universitas Wiraraja',	'2.23',	'4',	'saya adalah mahasiswa yang sedang menjalani pendidikan S1 Informatika, saya suka mencari tantangan baru. saya selalu ingin tahu tentang hal-hal baru, dan kehidupan sehari-hari saya sering mengapresiasi diri saya dengan mengembangkan minat dan bakat diri saya.',	'memiliki pekerjaan impian saya dan saya dapat membahagiakan orang tua',	'saya punya pengalaman organisasi di fakultas yaitu HIMATIKA saya menjadi sekretaris, melakukan tanggung jawab di event webinar peluncuran pembuatan aplikasi',	1,	1654842984,	NULL,	0),
('SCHLR-HFDHD-c0f6cf',	'USR-HFDHD-af3a4',	'Hafidah Dwi Cahyani',	'2002-05-30',	'89653676334',	'Jl Raya Mustikasari no 121 rt 01 rw 04, 171 51 Kecamatan Bantargebang Kelurahan Bantargebang Kota Bekasi, Jawa Barat',	'Pendidikan Matematika/Fakultas',	'University of Muhammadiyah Pro',	'3.87',	'4',	'Saya adalah mahasiswa semester 4 yang mengambil jurusan pendidikan matematika. Saya memiliki hobi melukis untuk merefleksikan diri saya ketika lelah dengan beratnya dunia perkuliahan. Orang tua saya belum mengizinkan saya untuk bekerja ketika saya masih di dunia perkuliahan. Alasan terbesar orang tua saya adalah mereka takut jika saya tidak lulus tepat waktu dan mengabaikan tugas akhir ketika sudah nyaman bekerja. Namun di sisi lain, saya menyadari bahwa ayah saya telah menghadapi masa pensiun dan saya masih memiliki adik yang bersekolah pada jenjang sekolah menengah atas. Saya mencoba untuk mencari jalan keluar dengan mendaftar beasiswa dan perlombaan yang dapat menghasilkan hadiah meskipun belum ada hasilnya sampai saat ini. Berdasarkan hal tersebut, saya mencoba terus berusaha menghidupi kebutuhan kuliah saya dengan mencari beasiswa yang dapat membantu saya. Di sisi lain, saya adalah orang yang komunikatif dan berjiwa leadership dalam kegiatan di kuliah dan di luar dunia perkuliahan. Saya senang bercengkrama dengan orang baru, terutama jika saya bertemu orang yang berbeda jurusan dengan saya. Melalui hal ini, saya dapat merepresentasikan ilmu yang saya miliki dalam berbagai aspek untuk menciptakan inovasi baru kedepannya.',	'Motivasi terbesar dalam hidup saya \"cobalah apapun yang dapat dilakukan, meskipun presentase keberhasilannya hanya 0,001% bahkan dalam ilmu statistik tingkat keberhasilan tidak boleh melebihi harga tabel maksimal yaitu 1. Oleh karena itu apapun yang akan saya lakukan, itu masih menjadi kesempatan\". Mimpi terbesar saya adalah menciptakan dunia pendidikan lebih baik bagi anak-anak untuk tetap bersekolah tanpa khawatir dengan kesulitan latar belakang ekonomi rendah, sehingga putus sekolah. Cara yang akan saya lakukan kedepannya adalah mencoba untuk bergabung dengan komunitas untuk membentuk projek bersama dalam menciptakan pembayaran sekolah di Indonesia dan solusi bagi keluarga ekonomi rendah yang memiliki anak prestasi dan yang kurang berprestasi mendapatkan hak yang sama. Saya memiliki rencana untuk mengikuti lomba yang bekerjasama dengan BUMN dan Kemendikburistek untuk mewujudkan ide ini.',	'Iya. Saya bergabung dengan organisasi Karang Taruna Rt 01. Meskipun ini adalah organisasi kecil dalam lingkungan Rt, namun melalui organisasi ini kami menciptakan inovasi \"Sedekah Sampah\" dari setiap rumah warga yang telah dibagikan karung untuk sedekah sampah yang berarti barang bekas dan barang apapun beruoa botol, kardus, galon, dll. Melalui kegiatan ini, kami dapat mengumpulkan hasil sedekah sampah menjadi uang yang akan dikelola menjadi kegiatan \"Tebus Murah\" yaitu membuat paket sembako murah yang dapat ditebus bagi setiap warga yang telah menyumbangkan sampahnya.',	1,	1654319766,	NULL,	0),
('SCHLR-HKMMS-98a254',	'USR-HKMMS-621d1',	'HIKMA IMUS PUTRA',	'2001-08-02',	'81348626255',	'Jl. Anggur, Rt.10, desa sanur, kec. Tulin onsoi, kab. Nunukan, Kalimantan Utara',	'Teknik Kimia',	'Politeknik Negeri Nunukan',	'3.88',	'6',	'Assalamualaikum wr. wb.\r\nSalom\r\nOm swastiatu\r\nNama budaya\r\nSalam kebajikan\r\n                      LATAR BELAKANG\r\nSaya adalah anak perbatasan negara malaysia tepatnya kalimantan utara, tempat saya yang sering di juluki daerah 3T (Terpencil, terdalam dan terpelosok). Namun dari situ saya sadar suatu kondisi maupun daerah bukan jadi pagar pembatas saya tapi keraguan lah pembatasnya. Mulai dari situ saya lulus dari Sma Negeri 1 Sebuku, sudah mulai mempunyai motto hidup yaitu mencari ilmu sebanyak-banyaknya serta mengimplementasikanya kembali di daerah saya. Terlepas dark bangku Sma saya berhasil melanjutkan kuliah di politeknik negeri nunukan, walaupun kadang berat hidup di daerah orang. All hasil saya kuliah sambil kerja sampingan, Alhamdulillah bisa buat makan dan bayar kos. Hingga di semester 3, saya sangat bangga dengan diri saya karena saya terpilih sebagai ketua umum di jurusan saya, dan mendapatkan banyak sekali pengalaman, soft skill dan teman-teman yang ceria. Hingga saat ini saya berharap program ini menjadi jembatan buat saya untuk meningkatkan dan menggali potensi diri yang kemudian akan di baktikan ketanah air tercinta dan masyarakat indonesia, di program ini saya yakin akan memilih generasi yang mampu berkomitmen bukan sekeder nominal beasiswa tapi apa tangung jawab atas besiswa yang di dapatkan. Kemudian dari situ saya akan bersyukur kepada allah swt, kedua orang tua dan teman-teman yang sudah mensuport saya. Saya yakin saya mampu menaklukan lautan yang luas dan menyandarkan kapal indonesia ke tujuan kita bersama yaitu menjadi generasi 4.0 yang Objektif, Intelektual dan Berkomitmen tinggi kepada negara dan bangsa.\r\n      Akhir kata Wabillahitopikwallhidayah wassalamualaikum wr. wb.\r\nYakusa (Yakin Usaha Sampai)',	'Assalamualaikum wr. wb.\r\nSalom\r\nOm swastiatu\r\nNama budaya\r\nSalam kebajikan\r\n                      Mimpi terbesar\r\nMimpi saya menjadi pengusaha kuliner dan menjadi kitchen chef mewujudkan yah dengan prinsip 4 AS : Kerja keras, Kerja cerdas, Kerja tuntas dan Kerja Ikhlas\r\nWabbillah hitopik wallhidayah wassalam mualikum wr. wb.',	'Assalamu\'alaikum\r\nOm swastiatu\r\nNama budaya \r\nSalam kebajikan\r\n \r\n          Pengalaman Organisasi\r\n1. Sebagai anggota Himpuanan mahasiswa Islam (HMI) 2021-2022, di sini saya di gembeleng mulai dari soft skill seperti publik speaking, leadership dan intelektual.\r\n2. Ketua umum Himpunan mahasiswa teknologi pengolahan hasil perikanan (HIMALOGIK) 2020-2021 di sini saya di ajarkan menjadi pemimpin yang bijak, mengeri dinamika jurusan, menerima sara dan masukan. Dan tahu akan administrasi.\r\n3. Anggota penuh HIMPUNAN MAHASISWA PERIKANAN INDONESIA (HIMAPIKANI) 2021-2023\r\nWassalamu\'alaikum',	1,	1654504351,	NULL,	0),
('SCHLR-HLMML-a8e548',	'USR-HLMML-64e66',	'Hilma Maula',	'2005-01-19',	'83895319057',	'Kec. Klari\r\nKab. Karawang\r\nProv. Jawa Barat\r\nIndonesia',	'IPA',	'MAN 2 KARAWANG',	'2.68',	'4',	'Saya putri pertama dari 3 bersaudara.\r\nHobi saya membaca, menulis, menggambar, dan mendesain.\r\nSatu kata yang menggambarkan saya: TERTUTUP.\r\nTeman-teman saya yang mengutarakan itu. Katanya, sangat sulit mengorek-ngorek kehidupan saya. Bahkan, orang terdekat saya, termasuk ibu-bapak, mengatakan hal yang sama. Saya seorang yang pendiam baik di dalam maupun di luar rumah.\r\nTapi diamnya saya menghanyutkan. Dalam diam saya memperhatikan karakter satu persatu orang yang berinteraksi dengan saya. Dan karena itu, saya bisa menyesuaikan sikap saya pada tiap-tiap orang yang saya kenal.\r\nGuru saya bilang, saya mempunyai kharisma. Saya bukan orang yang garang, apalagi kasar, tapi banyak orang yang turut pada saya, karena mereka kagum. Begitu penuturan guru saya.\r\nKelemahan saya dalam pertemanan. Karena saya bukan tipe orang yang menyukai kebebasan, dan tidak pernah bisa menolak perintah orangtua dan guru, teman-teman saya kurang menyukai saya.\r\nMereka merasa khawatir dan tidak bebas jika berlama-lama di dekat saya.\r\nTapi saya bersyukur, tidak terlalu banyak teman, tapi berkualitas, membuat saya memiliki waktu me-time yang cukup banyak. Dan saya tidak perlu berlelah-lelah hangout dengan teman.',	'Mimpi saya ingin menjadi Bidan yang berkualitas dan shalihah, saya mewujudkannya dengan usaha, yaitu belajar sungguh-sungguh. Juga diiringi doa dan disiplin dalam beribadah.',	'Ya, saya pernah menjadi ketua OSIS semasa SMP. Dan menjadi anggota OSIS semasa SMA ini.',	1,	1653558884,	NULL,	0),
('SCHLR-HLMYS-192080',	'USR-HLMYS-e057f',	'Helmy Shandria Muzanni',	'2002-08-23',	'85860546591',	'Jl. Manisi No. 241 Kel. Cipadung Kec. Cibiru Kota Bandung Prov. Jawa Barat',	'Pendidikan Biologi',	'UIN SGD Bandung',	'3.90',	'2',	'Saya adalah seseorang yang ingin meraih cita-cita dan ingin bermanfaat bagi orang banyak. Dengan bersekolah tinggi, meng-upgrade diri, dan mempertebal pengalaman serta kemampuan sehingga bisa mengantarkan saya pada tujuan-tujuan besar yang ingin saya capai. ',	'Berkontribusi besar pada dunia pendidikan dengan mendirikan sebuah lembaga pendidikan gratis demi memberikan kesempatan akses pendidikan yang mudah bagi anak-anak yang terbelakang serta mencerdaskan kehidupan anak-anak masa depan bangsa, khususnya di daerah saya terlebih dahulu. Untuk mewujudkannya, saya harus menyelesaikan studi saya di bidang pendidikan kemudian mengimplementasikannya di dunia sehari-hari dan mulai mengajari anak-anak di sekitar saya yang merasa ksesulitan untuk mendapatkan kesempatan belajar.',	'Ya. Saat SMP, saya menjadi anggota PMR dan mengikuti berbagai kegiatan relawan, seperti panitia kegiatan kemanusiaan, donor darah, lomba. Di SMA, saya menjadi ketua ekstrakurikuler English Club dan mengikuti berbagai perlombaan. Serta saya juga menjadi bagian dari keluarga besar Duta Generasi Berencana (Genre) Kab. Garut dan ikut serta dalam kegiatan relawan, seperti bagi-bagi takjil di bulan Ramadan.',	1,	1655743197,	NULL,	0),
('SCHLR-HLNVC-938974',	'USR-HLNVC-14157',	'Helinvia Charis Noija',	'2002-02-16',	'82293272397',	'Jl. dr.Kayadoe',	'Akuntansi',	'Pattimura',	'3.58',	'2',	'Saya adalah seorang mahasiswi berusia 20 tahun yang sedang menempuh pendidikan S1 di Universitas Pattimura tepatnya pada Fakultas Ekonomi & Bisnis (Jurusan Akuntansi). Seperti Mahasiswi/Pelajar pada umumnya, saya juga senang belajar dan menikmati masa muda dengan baik. Saya adalah orang yang mudah berperasaan atau bahasa gaulnya mudah baper pada hal-hal yang entah itu membuat sedih maupun senang. Ketika ada yang membentak saya sekalipun tak sengaja atau bercanda, saat-saat itu juga saya bisa mengeluarkan air mata, dan ketika ada yang memuji tentang kelebihan saya, disaat itu juga saya merasa tersentuh dan sedih. Saya juga adalah orang yang gampang overthinking, terkadang ketika saya merasa ada yang aneh dari perlakuan seseorang terhadap saya maka saya akan mencari letak dimana kesalahan saya pada orang tersebut, padahal biasanya saya tak melakukan kesalahan apa-apa tetapi saya memang sangat gampang kepikiran terhadap sesuatu. Tetapi disatu sisi saya juga adalah orang yang berusaha untuk menjadi lucu atau pencair suasana di lingkungan pertemanan dan keluarga saya sekalipun kepribadian saya adalah seorang yang intorvert, dimana ketika menghadapi banyak orang saya terkadang merasa takut dan gugup serta bingung. Ohh, dan satu lagi saya sangat senang sekali makan padahal saya seorang yang kurus badannya, saya juga senang sekali menulis serta menonton youtube.',	'Mimpi terbesar saya adalah membanggakan kedua orangtua saya, keluarga, Bangsa, dan Negara. Sehingga saya akan berusaha belajar dengan giat agar dapat mewujudkan mimpi saya tersebut.',	'Saya pernah bergabung menjadi anggota Osis di tingkat SMP dan menjadi Ketua Osis di tingkat SMA.',	1,	1653663059,	NULL,	0),
('SCHLR-HLNVC-d6f0f2',	'USR-HLNVC-14157',	'Helinvia Charis Noija',	'2002-02-16',	'82293272397',	'Jl. dr.Kayadoe',	'Akuntansi',	'Pattimura',	'3.58',	'2',	'Saya adalah seorang mahasiswi berusia 20 tahun yang sedang menempuh pendidikan S1 di Universitas Pattimura tepatnya pada Fakultas Ekonomi & Bisnis (Jurusan Akuntansi). Seperti Mahasiswi/Pelajar pada umumnya, saya juga senang belajar dan menikmati masa muda dengan baik. Saya adalah orang yang mudah berperasaan atau bahasa gaulnya mudah baper pada hal-hal yang entah itu membuat sedih maupun senang. Ketika ada yang membentak saya sekalipun tak sengaja atau bercanda, saat-saat itu juga saya bisa mengeluarkan air mata, dan ketika ada yang memuji tentang kelebihan saya, disaat itu juga saya merasa tersentuh dan sedih. Saya juga adalah orang yang gampang overthinking, terkadang ketika saya merasa ada yang aneh dari perlakuan seseorang terhadap saya maka saya akan mencari letak dimana kesalahan saya pada orang tersebut, padahal biasanya saya tak melakukan kesalahan apa-apa tetapi saya memang sangat gampang kepikiran terhadap sesuatu. Tetapi disatu sisi saya juga adalah orang yang berusaha untuk menjadi lucu atau pencair suasana di lingkungan pertemanan dan keluarga saya sekalipun kepribadian saya adalah seorang yang intorvert, dimana ketika menghadapi banyak orang saya terkadang merasa takut dan gugup serta bingung. Ohh, dan satu lagi saya sangat senang sekali makan padahal saya seorang yang kurus badannya, saya juga senang sekali menulis serta menonton youtube.',	'Mimpi terbesar saya adalah membanggakan kedua orangtua saya, keluarga, Bangsa, dan Negara. Sehingga saya akan berusaha belajar dengan giat agar dapat mewujudkan mimpi saya tersebut.',	'Saya pernah bergabung menjadi anggota Osis di tingkat SMP dan menjadi Ketua Osis di tingkat SMA.',	1,	1653663098,	NULL,	0),
('SCHLR-HLWT-b108ba',	'USR-HLWT-ac1c85',	'Heliawati',	'2002-02-08',	'81389243275',	'Kp.Bengras RT/RW:002/003 Desa: Sindang Mandi Kecamatan : Anyer Kabupaten : Serang Provinsi : Banten',	'Pendidikan Matematika FKIP',	'Universitas Sultan Ageng Tirta',	'3.70',	'4',	'Saya adalah seseorang yang disiplin, bertanggung jawab, senang mengelola administrasi. Sehingga hal tersebut yang menjadikan motivasi saya untuk ikut dalam organisasi, dari organisasi banyak sekali pengalaman yang bisa saya dapatkan salah satunya yaitu saya dapat memanage antara waktu belajar dengan waktu saya berorganisasi. Kemampuan saya adalah mengelola administrasi, adapun pencapaian saya ialah dengan mendapatkan medali perunggu pada lomba Kompetisi Hari Pendidikan Nasional (HARDIKNAS) dan Kompetisi Sains Indonesia (KSI) 2021 pada bidang matematika yang diselenggarakan oleh POSI ',	'menjadi orang sukses, ahli statistika atau menjadi pengusaha cara mewujudnya yang pasti harus belajar dengan sungguh-sungguh supaya saya bisa mencapai impian saya, selain itu harus dibarengi dengan minta doa kepada allah karena sebaik-baiknya rencana manusia akan tetapi ketetapan allah itu nyata. Lalu kita juga harus meminta restu kepada kedua orang tua kita',	'Dari Sma hingga sekarang saya sangat senang berorganisasi baik dalam sekolah/univ ataupun di luar. pada saat sma saya mengikuti  organisasi OSIS,PRAMUKA, dan DRUMBAND lalu diluar nya yaitu Relawan Anyer. Sedangkan ketika saya menjadi mahasiswa organisasi yang saya ikuti yaitu AKMI dibidang kerohanian dan KSR dibidang kesehatan. Dari organisasi itu saya banyak mendapakan pengalaman, pembelajaran, managemen waktu, tanggung jawab dan lainnya.',	1,	1655367702,	NULL,	0),
('SCHLR-HMDFR-46fb3f',	'USR-HMDFR-30812',	'Ahmad firdaus',	'2002-07-14',	'83166546625',	'sendang agung,paciran, lamongan ',	'manajemen bisnis syariah',	'uin salatiga',	'3.54',	'4',	'Perkenalkan saya ahmad firdaus  tinggal di kota lamongan, lahir pada tanggal 14 juli 2002. saya anak ke 1 dari 2 bersaudara dimana kondisi ekonomi cukup, tidak kurang tidak lebih , oleh karena itu untuk meringankan orang tua, saya berharap dapat memperoleh beasiswa ini.\r\nSaya memiliki prestasi dimana pada tahun 2021 saya memperoleh banyak kejuaraan  lomba di tingkat nasional baik berupa fotografi, videografi.karya tulis Dll. hoby saya olahraga. Pada tahun 2020 saya sering juara tingkat kabupaten / kawegangan\r\nHarapan saya dapat meringankan orang tua dalam hal biaya kuliah dan menjadi kebangaan orang tua dimana anak pertama yang akan dapat gelar sarjana di keluarga saya.',	'saya ingin menjadi pengusaha yang sukses dan cara saya untuk meweujudkan nya dengan selalu meyakinkan diri saya untuk bisa menghadapi semua masalah / resiko yang saya hadapi dan selalu memahami pola pikir untuk bekerja secara lebih cerdas, bukan bekerja keras. saya juga biasanya mencari pengalaman marketing, pengalaman manajemen, Pengalaman Mengatur Keuangan,  Pengalaman Menjadi Seorang Pemimpin,  Pengalaman Komunikasi dan masih banyak pengalaman lain yang berkaitan dengan bisnis yang saya dalami.',	'saya punya pengalaman 7 tahun lebih dalam berorganisasi, biasa nya saya dalam ber organisasi selalu menjadi bendahara karna saya selalu amanah dan jujur dalam mengelola kaeuangan ',	1,	1655053434,	NULL,	0),
('SCHLR-HMDFZ-2533f9',	'USR-HMDFZ-0fff8',	'Ahmad Fauzan Haridin',	'2002-05-27',	'85346145722',	'Jalan Sri Rahayu No. 4',	'S1 Pendidikan Luar Biasa/FIP',	'Universitas Negeri Malang',	'3.53',	'2',	'Halo, Assalamualaikum Wr. Wb. perkenalkan nama saya Ahmad Fauzan Haridin biasa dipanggil Ochan, saya anak pertama dari 4 bersaudara, saya lahir di Kota Kendari pada tanggal 27 Mei 2002. Saat ini saya sedang menempuh pendidikan jenjang S1 di Universitas Negeri Malang Fakultas Ilmu Pendidikan Jurusan Pendidikan Luar Biasa. Sejak masa SMA dan kuliah sekarang ketika ada waktu luang pun saya selalu berusaha untuk mempelajari hal-hal yang bisa mendukung kompetensi saya dan sesuai dengan jurusan saya, contohnya Public Speaking, Bahasa Inggris/Bahasa Asing lainnya, dan Bahasa Isyarat (komunikasi Tuli/Tuna Rungu).',	'Setelah lulus kuliah S1 Pendidikan Luar Biasa di Universitas Negeri Malang, saya akan mencoba mendaftar kuliah lagi mengambil S1 Psikologi di beberapa universitas baik Negeri maupun Swasta yang menyediakan Program Kelas Paralel/Karyawan, kenapa saya ingin melakukan hal tersebut? Karena saya ingin menambah wawasan dan pengalaman saya serta membuka Biro Klinik Psikologi, hal tersebut terjadi karena saya juga masih tertarik dan ingin belajar mengenai kepribadian manusia itu sendiri. Setelah itu saya akan berjuang menjadi Guru SLB yang berstatus PNS dan berusaha menjadi Juru Bahasa Isyarat yang saya impiankan selama ini karena Bahasa Isyarat adalah hal yang baru dan unik bagi saya untuk bisa mengenal Dunia Disabilitas terutama untuk teman-teman Tuli/Tunarungu. Saya juga berkeinginan menjadi Investor Saham sekaligus membuat suatu usaha yang dimana dapat membantu kesetaraan dalam bekerja bagi teman-teman Non Disabilitas maupun yang Disabilitas khususnya Tuli/Tunarungu dan mendirikan sebuah Yayasan yang bernama Yayasan Peduli Inklusif Indonesia (YP2I) yang dapat membantu memberdayakan kelompok-kelompok rentan/marginal maupun saya juga berkeinginan mendirikan sebuah Organisasi Disabilitas terutama mengenai Tuli/Tunarungu dan Tuna Netra serta membangun Forum Inklusif di daerah saya Provinsi Sulawesi Tenggara ini.',	'1. TenD For Youth Indonesia (Komunitas/Platform Online yg bergerak dibidang Keluarga dan Anak) - Sekretaris Divisi Program Tahun 2021/2022\r\n2. Youthped Indonesia (Komunitas/Platform Online yg bergerak dibidang Kesehatan Mental dan Mengatasi Rasa Insecure) - Vice Leader Relation Tahun 2022\r\n3. UKMP (Kepenulisan) UM - Anggota Departemen Inkubator Tahun 2022\r\n4. Panitia Sie Humas Seminar Swara Bahtera dari Departemen Politik & Propaganda BEM FIP UM Tahun 2022',	1,	1655740231,	NULL,	0),
('SCHLR-HMDFZ-91a066',	'USR-HMDFZ-0c7c6',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655568446,	NULL,	0),
