Disabilitas terutama mengenai Tuli/Tunarungu dan Tuna Netra serta membangun Forum Inklusif di daerah saya Provinsi Sulawesi Tenggara ini.',	'1. TenD For Youth Indonesia (Komunitas/Platform Online yg bergerak dibidang Keluarga dan Anak) - Sekretaris Divisi Program Tahun 2021/2022\r\n2. Youthped Indonesia (Komunitas/Platform Online yg bergerak dibidang Kesehatan Mental dan Mengatasi Rasa Insecure) - Vice Leader Relation Tahun 2022\r\n3. UKMP (Kepenulisan) UM - Anggota Departemen Inkubator Tahun 2022\r\n4. Panitia Sie Humas Seminar Swara Bahtera dari Departemen Politik & Propaganda BEM FIP UM Tahun 2022',	1,	1655739660,	NULL,	0),
('SCHLR-HMDFZ-ff230a',	'USR-HMDFZ-11f9e',	'Ahmad Fauzi Rahmani',	'2001-12-28',	'88220680962',	'Jl. Pagarsih Gg. Siti Mariah 6 No. 481 Rt 09 Rw 01 Jamika, Bojongloa kaler Bandung',	'Pendidikan Bahasa Inggris',	'Institut Keguruan dan Ilmu Pen',	'3.62',	'4',	'Seorang mahasiswa yang ingin melanjutkan ke luar negeri',	'Kuliah di Melbourne University dengan banyak beroda, usaha giat belajar, mencari beasiswa dan tawakkal kepada Allah SWT',	'Waktu di SMP jadi anggota OSIS di divisi kerohanian, di MAN jadi ketua MPK periode 2018-2019, sekretaris PAC IPNU Bojongloa kaler 2021-2022 anggota Divisi seni dan olahraga di PC IPNU Kota Bandung 2021-2022',	1,	1653880003,	NULL,	0),
('SCHLR-HMDML-24a0ed',	'USR-HMDML-40919',	'Ahmad Maliki Homsa Jaya',	'2002-01-20',	'8382663096',	'Dusun Sindang Sari, Rt.001, Rw.005, Baktirasa, Sragi, Lampung Selatan',	'Agroekoteknologi/Pertanian',	'Universitas Sultan Ageng Tirty',	'3.80',	'4',	'Saya merupakan Mahasiswa semester 4 dari Jurusan Agroekoteknologi, Fakultas Pertanian di  Universitas Sultan Ageng Tirtayasa memiliki IPK 3,80 dengan IP semester 3 (3,87). Memiliki bakat dibidang olahraga dan juga selalu bekerja keras dan selalu ingin tahu tentang hal baru, mudah beradaptasi dengan lingkungan,tidak pernah menyerah. Saya berasal dari Keluarga yang berlatar belakang pendidikan tinggi di bidang keguruan.',	'Saya memiliki mimpi ingin melanjutkan studi keluar negeri, saya dapat mewujudkan hal tersebut dengan mengikuti beasiswa ybbfoundation ,karena ybbfoundation memberikan kesempatan untuk mahasiswa ataupun pelajar agar dapat melanjutkan studi keluar negeri.',	'Saya mrmiliki pengalaman organisasi\r\n1. Menjadi anggota pendataan di Persaudaraan Muslim Pertanian Untirta yang bertugas mendata anggota Permai\r\n2. Menjadi Ketua Departemen Media Dan Syiar di Persaudaraan Muslim Pertanian Untirta yang mrmiliki tugas untuk mrmbuat pamflet, poster, dan banner yang kemudian di sebar di media sosial.\r\n3. Menjadi anggota karang taruna desa didesa baktirasa, yang bertugs untuk membantu masyarakat dalam segala kegiatan\r\n4. Menjadi Relawan di posko Mudik lebarn tahun 2018.',	1,	1654063327,	NULL,	0),
('SCHLR-HMDRH-6f5aa6',	'USR-HMDRH-8f1ca',	'Ahmad Raihan',	'2001-08-23',	'82158126610',	'Jl. Hikmah Banua Gg. Bersama KM.6 No.39',	'Pendidikan Bahasa Inggris',	'Universitas Terbuka',	'3.79',	'3',	'I am a college student who has some experience in teaching English. I am the eldest of two siblings. Currently, I am taking a college at Universitas Terbuka and studying TOEFL in Pare, East Java. I have been staying in Pare for 2 years, exploring more and more about English and how to apply it in my daily life. As I am staying over here, I have been to some places teaching English to students and teachers for a short period. Some programs that I taught mostly lasted around 2 weeks until 1 month. Currently, I am focused on studying TOEFL, achieving a 517 score on the TOEFL Simulation test at Mahesa Institue Pare. I graduated from Vocational High School with a major in Multimedia. I was in an internship in 2 places named La Vanilla Photography Printing and Prima Banua Televisi. Each of them took me 3 months to complete. I learned a lot from those 2 awesome experiences. Since I got many fantastic experiences with English and Multimedia, I am sure that some skills that I will get soon when I join this scholarship will help me to improve my soft skill much better than before.',	'My biggest dream is to be a director at a language foundation. I have traveled many times to get experience on how to handle something from the smallest to the biggest, from the simplest to the most complex. Yet, I still need to learn much more about leadership which will help me further learn about being a good director. The vision of the YBB Foundation scholarship is to prepare the best leader for facing a hard time in the future, which will help me strengthen my character about being the best leader. Getting unexplored skills by joining this program will allow me to open my eyes wider than before, so I could also improve my soft skills. ',	'I have some experience in a teaching organization. Once, our foundation sent me to Banjarmasin, South Kalimantan, to teach some students there for a month and a half. Teaching approximately 250 students, I was the tenth-grade homeroom teacher. I was in a Documentary division that edited and took some daily pictures so we could post them on our social media daily. It made me responsible for those teachers who didn\'t post it on social media and would be called by me and tell me why. It was a basic task, but it was still a task, and I felt it was my responsibility to take care of it.\r\n\r\nThe next experience is the same as before. Our foundation sent a team consisting of 14 members to Depok. The program lasted for three months; this program was the longest I ever had. I was assigned to be in the documentary division again exactly. I was the leader of the team. But this time, my task was only supervising my team, whether they took, edited, and even posted on social media or not. My team was quite successful in handling the three tasks that I mentioned before. I got the hardest job, making a beautiful short movie for our program. The video was around 10 minutes. We watched the movie together last night of the program, and the students were amazed.\r\nThe next experience is the same as before. Our foundation sent a team consisting of 14 members to Depok. The program lasted for three months; this program was the longest I ever had. I was assigned to be in the documentary division again exactly. I was the leader of the team. But this time, my task was only supervising my team, whether they took, edited, and even posted on social media or not. My team was quite successful in handling the three tasks that I mentioned before. I got the hardest job, making a beautiful short movie for our program. The video was around 10 minutes. We watched the movie together last night of the program, and the students were amazed.\r\n\r\nBased on the experiences I ever had with being a leader. However, I still need to improve my leadership skills. In the next five years of myself, I am sure the skills I will get by joining this program will help me be a good, wise, and smart leader. I hope I will learn how to handle solving problems as a team, face problems with patience, and manage awesome members.',	1,	1655555766,	NULL,	0),
('SCHLR-HMDTL-af4fa6',	'USR-HMDTL-87949',	'Ahmad Tulus Kurniawan',	'1997-06-04',	'85275553466',	'Jl. Sei Bangkatan No.13, Kel. Tanah Seribu, Kec. Binjai Selatan, Kota Binjai, Sumatra Utara',	'Teknik Sipil',	'Universitas Medan Area',	'3.71',	'6',	'Aku adalah anak ketiga dari empat bersaudara dari sebuah keluarga sederhana. aku memiliki sifat yang tertarik dengan hal-hal baru, selalu ingin tahu tentang hal baru. aku sangat menyukai diskusi, bertukar fikiran serta menjadi problem solving terhadap sebuah masalah. Makanya tak heran banyak teman-temanku yang menceritakan kisah hidupnya padaku. Aku memiliki semangat belajar yang tinggi, terbukti walaupun usiaku saat ini 25 tahun, aku masih terus belajar di Perguruan Tinggi S1 untuk meraih cita-citaku',	'Mimpi terbesarku adalah membuktikan kepada orangtuaku bahwa aku juga bisa sukses di bidang sipil ini, aku ingin lulus, dan memiliki pekerjaan yang mapan di teknik sipil. Kemudian aku berharap untuk bisa terus berkembang dan terus menguasai keahlianku di bidang sipil ini agar bisa membuktikan serta membalas apa yang telah orangtuaku berikan untuk ku',	'Sedari SD saya telah aktif di berbagai organisasi, contohnya saya mengikuti pramuka sejak kelas 3 SD, mengikuti olimipade matematika, dan Olimipiade Olahraga Nasional tingkat Propinsi dalam bidang sepak bola\r\n\r\nkemudian di SMP saya menjadi ketua pramuka di SMP Negeri 1 Binjai\r\nmengikuti berbagai kejuaraan Futsal tingkat Kota dan Propinsi\r\n\r\nDi SMA, saya mengikuti berbagai organiasai di SMA N. 2 Binjai\r\n1. Menjadi Wakil Ketua OSIS \r\n2. Menjadi Ketua organisasi PIK-R\r\n3. Menjadi Ketua Bidang RnD Pramuka\r\n4. Menjadi Ketua Organisasi Forum Anak Kota BInjai\r\n5. Menjadi Sekretaris bidang Kaderisasi di Rohis\r\n\r\nKemudian saya berkuliah 2 tahun di ITB, dan memiliki berbagai penglaman:\r\n1. Menjadi Ketua Angkatan Prodi Rekayasa Pertanian 2015\r\n2. Menjadi anggota MSDM di Pemilu Raya ITB 2015\r\n3. Menjadi ketua panitia LMD (Latihan Mujtahid Dakwah) Masjid Salman ITB\r\n4. Menjadi relawan pada bencana banjir di Karawang 2017\r\n5. Mengikuti Pengembangan Desa Binaan di Sumedang tahun 2017',	1,	1654564427,	NULL,	0),
('SCHLR-HMZHS-ea19e6',	'USR-HMZHS-64e70',	'Hamzah Sanusi Syam',	'2003-01-01',	'85161623600',	'Dusun bedadung wetan kaliwining Rambipuji Jember',	'KPI / B.inggris',	'UIN Khas Jember',	'3.30',	'1',	'Saya salah satu seorang lulusan dari pesantren yang baru saja masuk ke dunia perkuliahan',	'Membahagiakan kedua orang tua dengan usaha sebisa saya dan pantang menyerah',	'Saya mengikuti salah satu organisasi yang bernama pencak silat selain itu ada juga organisasi yang saya ikuti di pesantren',	1,	1654061982,	NULL,	0),
('SCHLR-HNNLH-a47980',	'USR-HNNLH-b37c5',	'Ahnan Ilham Hanafi',	'2004-06-07',	'85601939538',	'Kepurun-Prambanan Street, Katik, 003/001, Kecemen, Manisrenggo, Klaten',	'Arsitektur/Sains dan Teknologi',	'Universitas Teknologi Yogyakar',	'8.47',	'1',	'\"Belajar dan mengajarkan\" adalah salah satu mindset yang selalu saya tanamkan dalam kehidupan sosial. Di sekolah ataupun di kehidupan sosial masyarakat. Saya merupakan lulusan tahun 2022, berhasil mencapai kelulusan dari SMA N 2 Klaten. Dalam prosesnya saya mengalami banyak sekali manfaat dan ujian didalamnya, terkait yang utama yaitu leadership, sampai yang paling dasar, sekedar untuk bersabar dan bersyukur. Manfaat-manfaat yang saya dapatkan disekolah tersebut tidak saya sia-siakan. Ditengah-tengah masyarakat saya ikut mengabdikan diri sebagai anggota masyarakat yang baik dan sebagai abdi di Taman Pendidikan Al Qur\'an Masjid Atta\'awuun. Pengalaman-pengalaman semasa sekolah tersebut masih saya harapkan untuk bisa dilakukan saat saya di perguruan tinggi, walaupun ada terbesit dipikiran bahwa nantinya pasti ada waktu yang harus sangat-sangat dioptimalkan. Saya berniat melanjutkan studi saya di perguruan tinggi Yogyakarta, yaitu UTY (Universitas Teknologi Yogyakarta) dengan mengambil jurusan Arsitektur, dengan terbesit pikiran dalam hati saya saat memilih prodi ini \"Bagaimana sebuah rumah bisa mendekatkan diri seseorang kepada Tuhannya, dan memberikan kesan manusiawi yang saling bersosialisasi\" memperkuat motivasi saya untuk memilih prodi ini.',	'Setiap orang memiliki impian yang yang eksplisit dan implisit. Namun pada dasarnya impian yang berkualitas dapat diukur berdasarkan manfaatnya bagi diri sendiri dan orang lain. Impian yang ingin saya capai untuk diri saya sendiri adalah sangat sederhana, yaitu bisa mengelola akal pikiran secara benar dan pintar. Dengan akal yang pintar saya dapat melakukan semua hal, namun ketika saya memiliki akal yang benar, hal yang saya lakukan pasti ada manfaat disitu. Apapun itu. Lalu impian yang saya harapkan untuk orang lain adalah saya mempunyai impian untuk mereparasi daerah saya, terutama dari sisi tata letak wilayah, yang saya lohat mempunyai potensi didalamnya, terutama dalam 10 tahun kedepan akan dibangun tol antara Solo sampai Yogyakarta. Dengan pembangunan letak wilayah yang baik dan  terstruktur, pasti akan ada peningkatan ekonomi dan industri, diwilayah kami. Jalan yang saya tempuh dengan menjadi seorang arsitek, dengan selalu menjalin relasi dnegan pemerintah setempat, dan dengan kolaborasi-kolaborasi yang terjalin, maka terwujudlah rencana-rencana perbaikan wilayah',	'Betul, saya beberapa kali mengikuti  organisasi, di dalam sekolah maupun di luat sekolah. Didalam sekolah saya mengikuti organisasi seperti Majelis Permusyawaratan Kelas sebagai Ketua Umum, yang berfungsi sebagai aspirator, delegator, dan legislator. Hubungan kerja kami meliputi stakeholder seperti OSIS dan Perangkat Sekolah. Dan juga saya mengikuti organisasi Rohani Islam, yang disitu saya berperan sebagai ketua divisi pembinaan, yang mempunyai tugas untuk mengkoordinasi dan menyusun program-program pembinaan siswa, seperti mentoring, kajian ahad pagi, infaq, Pengajian Hari Besar Islam, dll. Di Luar sekolah saya juga mengikuti organisasi seperti SoCal Sisters, yang pada saat itu mengadakan kegiatan California Youth Leadership Summit. Dalam kerelawanan saya mangabdikan diri di Komunitas Pelajar Peduli Yogyakarta',	1,	1654393129,	NULL,	0),
('SCHLR-HNRTC-8c5850',	'USR-HNRTC-c4192',	'Haenrite Cahyo Agrea',	'2001-12-12',	'82135983274',	'Ngebuk, Sedahromo Lor 03/07, Kartasura, Sukoharjo',	'Teknik Elektro',	'Universitas Diponegoro',	'3.52',	'4',	'Saya adalah seorang Mahasiswa Teknik Elektro Universitas Diponegoro. Saya sangat menyukai tantangan serta perubahan yang maju dan positif, seperti perkembangan ilmu teknologi yang ada. Dalam hal akademis, saya sangat menyukai hal yang berkaitan dengan energi baru terbarukan. Dengan masuk dalam konsentrasi Teknik Tenaga Listrik saya ingin mewujudkan mimpi dan harapan saya terhadap Energi Bersih di Indonesia. Saya juga aktif dalam berbagai Organsisasi seperti IEEE SB Undip, Himpunan Mahasiswa Elektro, dan Ikatan Mahasiswa Sukoharjo Undip. Dalam berorganisasi saya mengedepankan kebebasan inovasi yang kritis dan bertanggung jawab.',	'Saya memiliki mimpi untuk membawa Indonesia benar-benar bersih dari Energi Fossil. Dapat dimulai dengan pengurangan ketergantungan batubara dan diubah menjadi sumber energi baru terbarukan. Karena pada faktanya, Indonesia kaya akan Sumber Daya Alam yang dapat diperbarui dan dimanfaatkan sebagai energi bersih. Selain itu, Saya juga memiliki mimpi untuk menerangi daerah terisolir di Indonesia dengan listrik yang murah, mudah, serta bersih, sehingga tidak mengganggu Alam Indonesia yang Asri.',	'Saya saat SMA sangat aktif dalam berorganisasi, bahkan saya dipercaya sebagai Ketua Dewan Ambalan di Pramuka SMA. Setelah lulus SMA dan melanjutkan ke Perguruan Tinggi,  Saya juga melanjutkan pengalaman organisasi saya dengan mengikuti IEEE SB Undip dengan dipercaya sebagai Ketua DIvisi FInance, serta tergabung dalam BIdang Kesejahteraan Mahasiswa Himpunan Mahasiswa Elektro sebagai staff muda.',	1,	1655664092,	NULL,	0),
('SCHLR-HNTSS-8c3fc7',	'USR-HNTSS-fa0fb',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655734978,	NULL,	0),
('SCHLR-HNTSS-f2b5f5',	'USR-HNTSS-fa0fb',	'Hani Tussellawati',	'2001-08-12',	'895604563268',	'Metro, Lampung',	'S1 Ilmu Keperawatan - Fakultas',	'Universitas Muhammadiyah Pring',	'4.00',	'4',	'Saya adalah pribadi yang mandiri, tekun, menyukai hal baru dan tertarik terhadap suatu tantangan, dan tidak mudah menyerah. Saya berharap saya dapat menjadi salah satu bagian dari Youth Break the Boundaries.',	'Mimpi terbesar saya adalah dapat mengangkat derajat kedua orang tua dan keluarga saya. Saya ingin membahagiakan dan memberikan hadiah haji kepada orang tua saya dan juga kakek nenek saya. Saya berusaha menggapai pendidikan setinggi-tingginya, guna menjadi pribadi yang mampu berdaya saing Internasional. Saya juga berusaha untuk bekerja part-time guna mencukupi kehidupan sehari-hari.',	'Saya aktif mengikuti organisasi Himpunan Mahasiswa (HIMA) dan menjabat sebagai sekertaris departemen Dana Usaha. Saya juga aktif mengikuti organisasi Seni Mahasiswa.\r\nSaya juga aktif mengikuti kegiatan volunteering, yang saat ini sedang saya jalani adalah sebagai Public Relation dari MatahariKita. Dan juga sebagai Brand Ambassador dari Menebar Manfaat dan Youthped Indonesia.\r\nSelain itu, saya juga aktif mengikuti kegiatan pengembangan diri seperti soft skill yang tidak bisa saya dapati dibangku kuliah.\r\nBeberapa waktu lalu, saya juga aktif menjadi relawan pemeriksaan kesehatan pada masyarakat, seperti pemeriksaan gula darah, kolesterol atau asam urat.',	1,	1655743733,	NULL,	0),
('SCHLR-HRD-293b51',	'USR-HRD-6ef498',	'Hardi',	'2003-04-26',	'81325168411',	'Karangsalam 3/3, kemaranjen, banyumas',	'Pendidikan Fisika',	'Universitas Islam Negeri Walis',	'3.5',	'2',	'Jika saya memiliki sebuah keinginan, yang dimana akan mempengaruhi atau berdampak baik terhadap diri sendiri atau lingkungan, maka sikap pantang menyerah akan terus meningkat, dengan kata lain bers Mangat dalam meraih keinginan',	'Merubah atau mengarahkan persepsi peserta didik tentang fisika, dengan anggapan sulit. Oleh sebab itu, saya melanjutkan pendidika fisika dengan tujuan menciptakan sebuahodel metode pembelajaran yang tepat sasaran sehingga fisika mudah dipahami dan dipelajari',	'Pelatihan self declare atau penyelia halal, sebuah pelatihan dari badan halal center di universitas dan berhasil lolos ',	1,	1655735669,	NULL,	0),
('SCHLR-HRDDN-dfbd92',	'USR-HRDDN-bfc1c',	'Haeruddin hifzi',	'2003-03-03',	'87765937586',	'Nusa Tenggara Barat, LOMBOK',	'Pendidikan Bahasa Inggeris',	'Universitas Mataram',	'2.78',	'2',	'Saya sangat suka belajar tp dengan keadaan sy kurang belajar karena harus mencari biaya sendiri. ',	'Membahagiakan ke 2 orang tua',	'Pernah',	1,	1654491040,	NULL,	0),
('SCHLR-HRLDP-afb581',	'USR-HRLDP-14370',	'Heraldo Petra Sumintono',	'2000-10-07',	'81381034790',	'Harapan Indah Blok HJ No. 11 , RT/RW 11/19 , Kelurahan Pejuang , Kecamatan Medan Satria , Bekasi , Jawa Barat',	'Teknik Perkapalan',	'Universitas Diponegoro',	'3.63',	'4',	'Saya merupakan mahasiswa tingkat 2 di Universitas Diponegoro. Saya memiliki seluruh komponen untuk dikategorikan berkepribadian positif. Saya aktif di organisasi namun juga memiliki nilai akademis yang baik. Saya mampu bekerja sama dalam tim dan saya juga mampu memaksimalkan sumber daya yang tim saya punya. Saya tidak segan untuk berkorban tetapi saya juga seorang yang cermat dalam menentukan langkah.',	'Mimpi terbesar saya adalah saya hendak membantu anak - anak lain di negeri ini agar tidak melalui kesulitan yang saya hadapi , yaitu masalah keuangan. Saya akan belajar dan bekerja ekstra keras hingga keuangan saya mampu membantu mereka. Dan melalui ybb foundation saya yakin akan membantu saya untuk mencapai tujuan saya lebih cepat.',	'Saya memiliki pengalaman organisasi di Ikatan Mahasiswa Studi Offshore Indonesia ( IMSO ) dan di himpunan teknik perkapalan yaitu HIMASPAL. Di kedua organisasi tersebut saya berkarya di bidang pengembangan sumber daya manusia. Di Imso saya sudah 2 tahun berkarya disana dan sekarang saya menjadi kepala divisi HRD dan tahun depan saya berencana untuk naik menjadi presiden IMSO Indonesia periode berikutnya. Di HIMASPAL sendiri saya menjadi staff bidang PSDM , dimana saya diberikan tanggung jawab untuk mengawal pengembangan mahasiswa tingkat lanjut melalui proker - proker yang tersedia.',	1,	1655619897,	NULL,	0),
('SCHLR-HRLMB-515898',	'USR-HRLMB-01e69',	'Herlambang',	'2004-02-26',	'81324105184',	'Kp. Sayuran Gg. Manunggal 2c 04/07 Kel. Cijerah Kec. Bandung Kulon',	'IPS',	'SMA Pasundan 7 Bandung',	'0.00',	'0',	'Nama saya Herlambang. Saya memiliki minat yang tinggi dalam bidang bisnis dan manajemen.\r\n\r\nSejak SMP, saya selalu mencari peluang bisnis. Beberapa bisnis yang pernah saya jalani antara lain thrift shop dan jasa sablon.\r\n\r\nTak berhenti sampai situ, saya juga bergabung dalam klub entrepreneur sewaktu sekolah. \r\n\r\nKetika waktu luang, saya selalu berusaha untuk mempelajari hal-hal baru yang bisa mendukung bisnis saya. Contohnya adalah digital marketing dan social media marketing',	'Saya ingin sekali menjadi pengusaha, sudah menyusun keinginan dan impian yang ingin dicapai namun banyak kendala sehingga belum memulai untuk berbisnisnya.\r\nCara saya mewujudkannya adalah Melangkah walau satu langkah, lakukan tindakan yang terkecil untuk bisa mewujudkan impian saya menjadi pengusaha. Misal langkah pertama adalah menuliskan rencana produk/jasa yang akan saya jual. Produk seperti apa yang akan saya jual pertama kali. Atau sederhana saja, langkah pertamanya adalah menelpon orang yang mempunyai produk yang akan saya jual. Dengan langkah pertama ide yang mendorong untuk langkah-langkah berikutnya. Dengan satu langkah itu saya akan merasa sudah memulai bisnis saya\r\n',	'Tidak',	1,	1653674008,	NULL,	0),
('SCHLR-HRSTL-037a7c',	'USR-HRSTL-f1b08',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654952465,	NULL,	0),
('SCHLR-HSNLY-ac1891',	'USR-HSNLY-ecdb7',	'Hasna Ulayya Badi\'ah',	'2003-07-09',	'85729847355',	'Jl. Kemanggisan Grogol Rt 13 Rw 08 No.55 ',	'Keagamaan ',	'Madrasah Aliyah Negeri 22 JAKA',	'9.21',	'0',	'Saya adalah lulusan tahun 2022 dari MAN 22 JAKARTA\r\nSaya tipe orang yang introvert, tetapi saya suka bergabung dengan beberapa organisasi, saya hobi membuat tulisan kaligrafi arab, saya suka bekerja secara team maupun sendiri ',	'Mimpi terbesar saya adalah saya ingin berkuliah di luar negeri yaitu di al azhar kairo, tetapi karena ekonomi keluarga saya yang kekurangan, mimpi itu rasanya sulit untuk wujudkan, \r\nMaka dari itu saya mencoba mendaftar berbagai macam beasiswa agar bisa berkuliah meskipun tidak berkuliah di al azhar kairo',	'Saya dulu mengikuti organisasi OSIS, karya ilmiah remaja dan juga Jurnalistik\r\nDi OSIS saya menjabat sebagai sekretaris, selama menjabat sebagai sekretaris saya belajar banyak hal mulai dari membuat proposal acara, mengatur file, membuat surat permohonan, membentuk kepanitiaan dan masih banyak lagi\r\nSelama saya bergabung di Organisasi Karya Ilmiah Remaja saya belajar banyak hal seperti membuat eksperimen, menyusun laporan hasil eksperimen mulai dari latar belakang, daftar isi, rumusan masalah, isi pokok dan juga referensi jurnal yang relevan\r\nSelama bergabung di Organisasi Jurnalistik saya belajar banyak hal seperti membuat jadwal acara, berbiacara di depan kamera, mengatur tata letak panggung, mengoperasikan beberapa aplikasi seperti zoom, google meet, ms.word, power point',	1,	1655195899,	NULL,	0),
('SCHLR-HYMHR-3957a3',	'USR-HYMHR-86cd4',	'Haya Mahira Sajida',	'2002-01-22',	'82299319123',	'Jalan Soekarno Hatta Bagan Besar, Bukit Kapur, Dumai, Riau',	'Fakultas Kedokteran',	'Universitas Syiah Kuala',	'3.33',	'3',	'Nama saya Haya Mahira Sajida. Anak pertama dari 3 bersaudara. Sejak berusia 12 tahun saya sudah merantau untuk bersekolah. Saya tinggal di Riau dan sejak SMP saya disekolahkan di Kudus, Jawa Tengah hingga lulus SMA. Dari SD hingga SMA. Kemudian saya melanjutkan kuliah di Fakultas Kedokteran Universitas Syaih Kuala. Dari SD hingga SMA saya selalu masuk di kelas unggulan. Di kelas unggulan, persaingan sangat ketat. semua orang berambisi untuk menjadi juara di bidang mereka masing- masing. saya sangat suka mencoba sesuatu hal yang baru karena menantang seperti kita berusaha untuk memecahkan misteri yang belum pernah dipecahkan sebelumnya. Hal itulah yang membuat saya tertarik dengan riset. Jurnal- jurnal penelitian membuat kita mengetahu sebab terjadinya suatu permasalahan dan bagaimana mengatasinya. Riset juga dapat memberikan berbagai solusi dan membandingkan antara solusi satu dan solusi lainnya sehingga kita bisa mempertimpangkan solusi seperti apa yang efektif untuk permasalahan kita. Ketertarikan saya ini berlanjut dengan mengikuti lomba-lomba yang berkaitan dengan riset. Baru- baru ini saya memenangkan juara 3 lomba literatur review dengan judul stem cell sebagai terapi kanker.',	'saya ingin menjadi dokter anak yang bermanfaat bagi orang lain. Tidak hanya dokter, saya  juga ingin menjadi peneliti dan inovator sehingga memudahkan masyarakat (terutama yang membutuhkan) dapat dengan mudah menjangkau perawatan kesehatan dan obat-obatan. Saya yakin keinginan saya ini membutuhkan dedikasi penuh dan semangat belajar yang tinggi untuk mewujudkannya. Oleh karena itu, saya akan rajin membaca jurnal- jurnal kesehatan terkini dan lebih sering mengikutu seminar- seminar terapi kesehatan. ',	'Punya. Saya pernah menjadi relawan kesehatan di salah satu klinik di Medan, relawan kebersihan di Banda Aceh, dan relawan menjadi tutor bahasa inggris saat masih SMA. Saat menjadi relawan kesehatan di salah satu klinik di Medan, fokusnya adalah pembelajaran dan observasi kegiatan tenaga kesehatan, seperti membantu proses persalinan.  Sedangkan, saat menjadi relawan kebersihan di Banda Aceh, fokusnya adalah edukasi pemilahan sampah karena sampah nantinya akan diolah menjadi barang yang berguna lagi. Untuk pengalaman organisasi, selama di FK, saya masuk ke organisasi CIMSA.',	1,	1654571653,	NULL,	0),
('SCHLR-HYYNN-df218a',	'USR-HYYNN-6254a',	'Hayyun Nafi\'ah',	'2002-08-23',	'85726836783',	'Dusun Lemahbang Desa Margomulyo RT/RW 014/002 Kecamatan Balen Kabupaten Bojonegoro, Jawa Timur',	'Farmasi/S1/Kesehatan',	'Universitas Nahdlatul Ulama Su',	'3.89',	'2',	'Nama saya Hayyun Nafi\'ah, sejak kecil saya mempunyai pribadi yang mandiri dan bertanggung jawab. Sejak kecil saya menemani dan menjaga adik saya, jika abah, ibu, dan nenek saya sedang bekerja. Saya mengajari adik saya banyak hal mulai dengan cara menulis,membaca, berhitung dan juga bersepeda. Dan semenjak dewasa saya ingin menjadi manfaat untuk semua orang. Untuk menjadi manfaat bagi orang-orang tentu tidak lah sulit. Salah satunya adalah menyembuhkan orang yang sakit. Menurut saya itu adalah sesuatu yang sangat menyenangkan.',	'Mimpi terbesar saya adalah membuat obat untuk penyakit yang saat ini belum ditemukan obatnya. Seperti orang yang menderita kanker, Leukimia, HIV/AIDS, dan lain-lain dapat sembuh dari penyakit yang di deritanya. ',	'Tidak',	1,	1655722267,	NULL,	0),
('SCHLR-JFR-0aa69b',	'USR-JFR-418fb6',	'Jefri',	'1995-09-29',	'81297995193',	'Jl. Kp. Lio Kec. Pancoran mas Kota Depok Jawa Barat 16431',	'Administrasi Perpajakan',	'Institut Stiami Depok',	'3.55',	'8',	'Saya mahasiswa aktif semester 8 dan mengambil Jurusan Administrasi Perpajakan S1',	'Sukses memiliki karir yang baik, dan menyenangkan keluarga dan orang tua saya',	'Mahasiswa aktif dalam organisasi seminar Job carrer',	1,	1654283220,	NULL,	0),
('SCHLR-JHYNS-7380a8',	'USR-JHYNS-1a378',	'JAHYAN SUGIARTO',	'2003-01-17',	'83870072734',	'Jl. Harapan raya Gg. Pandawa 2 sukarame, Bandar lampung',	'Pendidikan Matematika/Tarbiyah',	'UIN Raden Intan Lampung',	'3.57',	'1',	'Assalamu\'alaikum warahmatullahi wabarakatuh \r\nSalam sejahtera untuk kita semua.. \r\nPerkenalkan saya jahyan sugiarto biasa dipanggil iyan saya dilahirkan di Jawa tengah pada 17 Januari 2003,sekarang saya tinggal di desa pekon susuk kec. Kelumbayan kab. Tanggamus  provinsi lampung. Saya merupakan anak ke 4 dari 4 bersaudara, saat ini saya berprofesi sebagai mahasiswa UIN Raden intan lampung dengan prodi pendidikan matematika fakultas tarbiyah dan keguruan. \r\n  Saya adalah orang yang samangat, pantang menyerah dan giat belajar dari hal2 yang baru serta saya adalah orang yang disiplin dalam hal apapun. \r\nSelain kesibukan belajar di kampus saya juga menjadi mahasiswa aktifvis diantanya saya mengikuti UKM hiqma, HMJ Himatika dan Organisasi HMI. \r\n\r\nDemikian perkenalan singkat dari saya  \r\nSalam sejahtera untuk kita semua \r\nWassalamu\'alaikum wr. Wb',	'Membahagiakan kedua orang tua dan ingin mengangkat darajat orang tua dengan giat belajar',	'Organisasi Rohis saya selalu di ikut serta kan untuk melakukan perlombaan melukis dalam ajang kompetisi kabupaten ',	1,	1655229039,	NULL,	0),
('SCHLR-JKRFR-a838b4',	'USR-JKRFR-d3800',	'Jakaria Afriansyah',	'2002-04-19',	'89639755872',	'Blok bandongan RT 001 RW 006 kelurahan kaliwadas kecamatan sumber kabupaten cirebon',	'Tadris Biologi/Fakultas ilmu t',	'IAIN Syekh Nurjati Cirebon',	'3.28',	'1',	'Nama saya Jakaria Afriansyah. Saya terlahir dan dibesarkan dari keluarga yang sederhana. Pendapatan ayah tak menentu, yang bekerja sebagai seorang buruh tani. Sementara ibu hanya ibu rumah tangga biasa. Akan tetapi, ibu tetap berusaha membantu ayah dengan bekerja sebagai pembantu rumah tangga, walaupan hasilnya tak seberapa, setidaknya cukup untuk memenuhi kebutuhan sehari-hari. Saya mempunyai adik yang masih berada di bangku sekolah. Tentunya membutuhkan biaya yang cukup banyak untuk itu. Namun, hal ini tidak menyurutkan semangat saya untuk menempuh pendidikan setinggi mungkin.\r\n',	'Sudah tentu banyak sekali. Dan saya berharap ini bisa terwujud seiring berjalannya waktu dan jika saya di beri umur panjang serta sehat.\r\n\r\nkeluarga saya bisa hidup berkecukupan serta di berikan kesehatan dan juga umur panjang\r\nIngin membuat keluarga saya bangga atas apa yang telah saya perbuat:\r\n1. Saya ingin membawa seluruh keluarga saya untuk umroh/haji bersama\r\n2. Ingin menyekolahkan kedua adik saya setinggi mungkin sesuai dengan passion mereka\r\nMembuatkan rumah serta usaha kecil kecilan untuk orang tua saya di kampung\r\n3. Ingin membuka sekolah luar biasa di cirebon serta sekolah bagi anak anak kurang mampu maupun anak jalanan yang ingin mendapatkan pendidikan serta ilmu yang bermanfaat secara gratis\r\n4. Membuka rumah keterampilan untuk anak anak, ibu ibu dan lansia sebagai bentuk kegiatan yang bermanfaat\r\nDoakan saya ya semoga bisa mewujudkan impian saya ini. ',	'Iya, saya memiliki pengalaman organisasi yaitu saya sebagai anggota Himpunan mahasiswa biologi,anggota PMII, anggota HMI. ',	1,	1655232386,	NULL,	0),
('SCHLR-JKYPR-969f76',	'USR-JKYPR-53a98',	'Jeky Prima ',	'2001-06-10',	'82171145793',	'Jalan Pucuak Rantau,kuantan Singingi, Riau ',	'Hukum',	'Andalas ',	'3.98',	'1',	'Memiliki mimpi yang begitu tinggi tidak membuat saya menyerah untuk menggapainya terkendala biaya bukan lah menjadi alasan bagi say untuk menyerah . Saya jeky prima lahir di batu balang 10 Juni 2001, saat ini saya berusia 21 th dan sekarang lagi sibuk mengikuti webinar webinar di sosia media guna menambah pengetahuan Sealin itu saya aktif dalam berbagi kegiatan sekolah mulai dari osis ,tahfidz , monolog, pMR ,UKS ,Pramuka .',	'Mimpi terbesar saya adalah setelah saya wisuda nantinya saya ingin menerapkan dan menggunakan ilmu yang saya dapat menjadi anggota MpR jujur, amanah, dan tidak merugikan rakyat sebagai mana mestinya ,karena saya percaya bagaimana seorang pemimpin bisa memimpin kalau kata kata nya tidak dapat di percaya ,saya tau untuk mewujudkan nya tidak mudah serius,bersungguh sungguh tekun dan pantang menyerah adalah senjata saya.',	'Iya jadi waktu say SMA  saya menjadi koordinator dalam osis disana saya belajar bagai mana cara memimpin ,bekerja sama, saling tolong menolong,saling memahami dan saling melengkapi selam 2 tahun menjabat sekolah kami banyak mengalami kemajuan mulai dari prestasi,jumlah siswa yang mendaftar melonjak bahkan sampai masuk berita ,selain osis saya ikut juga Pramuku,pMR,UKS,monolog tahfidz dll.',	1,	1655213576,	NULL,	0),
('SCHLR-JLSTY-39045c',	'USR-JLSTY-a22e2',	'Juliasty Asnir',	'2003-07-19',	'82223350182',	'Jalan Roviga, Roviga residence 1 No.9, Tondo Palu Timur (Roviga residence 1)\r\nPALU TIMUR, KOTA PALU, SULAWESI TENGAH',	'Prodi Gizi Fakultas Kesehatan ',	'Universitas Tadulako',	'3.80',	'2',	'Perkenalkan saya Juliasty Asnir, yang biasa dipanggil dengan Asty lahir di Tinabogan, 19 Juli 2003. Saya berasal dari desa bernama desa Tinabogan kecamatan Dondo  yang terkenal dengan industri pertanian cengkeh. saya anak perempuan pertama dari tiga bersaudara. Hobi saya adalah membaca cerpen ',	'Mimpi terbesar saya adalah membahagiakan orang tua dan saya juga ingin menjadi orang yang berguna dan  bermanfaaat di masyarakat melalui ilmu. saya mengambil jurusan gizi agar nantinya saya bisa menjadi seorang ahli gizi dan bisa mengedukasi masyarakat dengan ilmu yang saya dapatkan dari perkuliahan saya',	'saya mahasiswa semester 2, untuk mengikuti organisasi permazi di prodi saya diharuskan mengikuti kegiatan GTA. selama 2 hari mengikuti kegiatan, saya mendapat banyak ilmu baru terkait keoorganisasian dan bagaimana caranya berorganisasi yang baik dan  benar. Ketika saya bersekolah di SMAN 1 Dondo saya juga pernah menjadi anggota osis yang mana saya mampu untuk bekerja sama dalam tim dengan baik bekerja sama Bersama teman teman dan guru maupun staff sekolah agar dapat berorganisasi dengan baik dan menjalankan kegiatan sekolah dengan baik',	1,	1655251790,	NULL,	0),
('SCHLR-JLYNT-f9057d',	'USR-JLYNT-0ada1',	'Julyanty Monalisa Nainggolan',	'2002-07-09',	'85762731739',	'Jl. Tanjung Permai XIV No.12-13, Tanjung Gusta, Kab. Deli Serdang',	'Sosiologi FISIP',	'Universitas Sumatera Utara',	'3.67',	'1',	'Hi..\r\nNama saya Julyanty Monalisa Nainggolan, lahir di Medan dan tinggal sekarang di\r\nDeli Serdang, Provinsi Sumatera Utara. Sekarang saya berusia 19 tahun, namun bulan\r\nJuli nanti saya sudah genap berumur 20 tahun. Saya berasal dari keluarga enam\r\nbersaudara, dengan seorang ibu yang begitu hebat yang mengurus kami penuh dari\r\nkami kecil sedangkan ayah kami tahun lalu sudah berpulang ke rumah Bapa di sorga.\r\nSaya lulus SMA dari SMA Kristen Kalam Kudus Medan tahun 2020. Saya\r\nmengambil Gapyear dikarenakan gagalnya saya mendapatkan PTN, kondisi saat itu\r\njuga masih pandemi. Jika saya memaksakan diri untuk berkuliah di perguruan tinggi\r\nswasta itu hanya akan menyulitkan keluarga saya. Saya juga masih punya kesempatan\r\ndua kali lagi untuk mengikuti seleksi masuk PTN, mungkin untuk mendapatkan yang lebih besar lagi kita perlu mengorbankan sesuatu. Apalagi saya benar benar ingin jadi mahasiswa salah satu PTN top. Meski harus menunda satu atau dua tahun, manataui memang rezeki saya tahun depan. Saya tidak menyerah, apapun yang baik saya lakukan demi menggapai cita cita saya. Hingga tahun 2021 saya akhirnya berhasil lolos di salah satu PTN yaitu USU dengan jurusan Sosiologi, karena masalah biaya tak terduga saya harus mengambil cuti di Semester 2 ini. Saya rasa, akademi saya sudah rusak sedikit gara gara ini. Maka saya memutuskan untuk kembali mendaftar SBMPTN mengambil PTN dan jurusan lain agar saya bisa kembali mengulang akademi saya dan mendapatkan yang lebih baik, dan syukurnya orang tua juga keluarga saya mendukung penuh rencana saya.\r\nJangan Pernah menyiakan setiap kesempata yang ada didepan mata.',	'Mimpi terbesar sayai dulu  daridulu menjadi seorang Psikolog. Sekarang saya ingin lebih memusatkan impian saya yaitu Psikolog Anak. \r\nCara saya mewujudkannya, saya tidak pernah berhenti untuk terus mencoba karena sekarang saya masih di jurusan Sosiologi padahal seharusnya saya mendalami psikologi. Saya kembali mencoba mengambil kesempatan kesempatan yang ada di depan mata saya. Saat ini saya dengan dukungan penuh orang tua dan keluarga, sedang menungu pengumuman hasil seleksi PTN dengan jurusan Psikologi yang saya pilih. Biaya tak menghalangi saya, ada banyak beasiswa yang bisa saya coba dan saya usahakan.',	'Untuk pengalaman organisasi, saya sekarang sedang bergabung di Paduan Suara Consolatio. Belum banyak pengalaman yang saya dapat, karena saya terbilang masih anggota baru. Saya bergabung sejak masuk kuliah dan itu baru beberapa bulan. Saya sudah mengikuti banyak latihannya yang diadakn dua kali seminggu. Di organisasi ini banyak anggotanya yang sudah jauh lebih berpengalaman dari kami (dari berbagai kalangan usia). Namun, mereks tetap membimbing dan melatih kami dengan sabar dan ramah, kerja sama yang baik antar anggota sangat terlihat disini.',	1,	1655745195,	NULL,	0),
('SCHLR-JNTLM-32b020',	'USR-JNTLM-20651',	'Janatul Munawaroh',	'2003-05-19',	'85788155648',	'RT.05/RW.04,Dusun Bulak Rejo Tengah,Desa Tempel Rejo,Kab.pesawaran,Lampung',	'akuntansi syariah fakultas eko',	'UIN raden intan lampung',	'3.55',	'2',	'nama saya janatul munawaroh,biasa dipanggil ana.berasal dari instansi UIN raden intan lampung jurusan akuntansi syariah dan sekarang sedang menempuh semester 2.selain fokus pada kuliah,saya juga mencari kegiatan diluar kampus seperti volunteer.pada saat ini saya sedang menjalankan 2 volenteer pada komunitas yang berbeda yaitu scholars for sumatra pada divisi kreatif dan kita literasi pada divisi social media.selain itu,saya mempunyai jiwa yang bertanggung jawab,disiplin,komitmen,dan menyukai hal baru.',	'mimpi terbesar saya adalah kuliah di al-azhar dengan beasiswa,dan cara saya untuk meeaih mimpi saya adalah gigih dalam belajar,mengeksplor wawasan baru,berusaha,berdoa supaya mimpi tersebut bisa terwujud',	'iya,\r\n1. saya pernah menjadi relawan pada komunitas Indonesia Hidden Heritage Week 2021 pada divisi Media management and promotion yang dilaksanakan pada 21-30 Oktober 2021 secara online.\r\n\r\n2. Volenteer scholars for sumatra divisi kreatif sedang menjalankan komitmen\r\n3. Volenteer kita literasi divisi social media sedang menjalankan komitmen',	1,	1654107014,	NULL,	0),
('SCHLR-JPTWR-c49980',	'USR-JPTWR-ea456',	'Jupita Waruwu',	'2002-06-06',	'82290122287',	'Nanggroe Aceh Darusallam',	'Akuntansi/Ekonomi',	'Universitas Teuku Umar',	'3.4',	'2',	'Saya Mahasiswi dari Universitas Teuku Umar. Saya anak dari seorang petani yang memiliki finansial kurang mampu. Saya lulusan dari SMA N 1 Woyla Barat di Pasi Mali. Saya menempuh kuliah dengan tekad namun ternyata tekad saja tidak cukup. Saya gagal dalam beasiswa yang pertama saya daftarkan. Saya sempat terpuruk antara melanjutkan perguruan tinggi saya, atau saya berhenti. Namun saya ingat masih ada Allah yang bisa membantu umat nya dari segi masalah apa pun itu. ',	'Mimpi saya adalah mengukir senyum dan tawa bahagia orantua dari hasil yang akan saya capai nanti. Meskipun kadang kala ombak dan badai menerpa kehidupan kami yang serba kekurangan ini saya terus yakinkan orangtua dengan mengatakan \"Bu, saya hanya ingin doa dan semangat dari Ibu. Kita memang orang tak punya tapi kali ini jangan menyerah bu bantu saya berjuang untuk mimpi dan harapan saya\".',	'Pernah. Saya pernah berada dalam gabungan organisasi IPELMAWAR (Ikatan Pelajar Mahasiswa/i Woyla Raya). Dalam organisasi tersebut saya mendapatkan pelajaran bagaimana cara nya menghargai dan memiliki cara pandang meskipun terkadang kami kadang kala memiliki pendapat yang berbeda pula. Saya juga pernah di tunjuk sebagai SEKERTARIAT dalam acara maulid Nabi Muhammad SAW pada tahun 2021.',	1,	1655524149,	NULL,	0),
('SCHLR-JSPYN-c3b3db',	'USR-JSPYN-ffcbf',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655122999,	NULL,	0),
('SCHLR-JSYL-320669',	'USR-JSYL-56f578',	'Jaisy Aulia',	'2005-04-22',	'882000246880',	'jl. Sapujagat blok E4 No.132 Kel. Sukaluyu Kec. Cibeunying Kaler Kota Bandung, Jawa Barat',	'IPS',	'SMA Yayasan Atikan Sunda Bandu',	'0.00',	'2',	'Saya masih menduduki kelas 11 di SMA Yayasan Atikan Sunda Bandung.\r\nSaya bersekolah SMP di Mts Manbaul Huda Bandung.\r\nSaya pernah mengikuti ekskul Tataboga, English Club, Memanah, Nasyid, Shurulkhan (bela diri islam) dan Tahsin Al Quran. \r\nSaya pernah menjadi ketua regu di acara Building Character pada saat kelas 2 SMP.\r\nSaya bersekolah dasar di SDN Pelita Bandung selama 2 tahun lalu saya pindah ke SDN 2 Kota Serang selama 1 tahun kemudian saya pindah lagi ke SD IT Persis Ciganitri.\r\nDi sd saya mengikuti ekskul Angklung dan Pramuka.\r\nSaya mengikuti bela diri Tae Kwon Do pada saat kelas 5 SD selama 1 tahun\r\nSaya juga pernah mengikuti lomba cerdas cermat dan juara 1',	'Mimpi terbesar saya adalah menjadi seorang pengusaha besar yang sukses.\r\nCara saya mewujudkannya adalah dengan saya bekerja keras, tidak mudah menyerah dan yakin terhadap diri sendiri.',	'Saya pernah mengikuti organisasi karang taruna di divisi menyiapkan kelangsungan acara lomba 17 Agustus',	1,	1653566231,	NULL,	0),
('SCHLR-JSYL-45768e',	'USR-JSYL-9509f4',	'Jaisy Aulia',	'2005-04-22',	'882000246880',	'jl. Sapujagat blok E4 No.132, Kel. Sukaluyu, Kec. Cibeunying Kaler\r\nKota Bandung, Jawa Barat.',	'IPS',	'SMA Yayasan Atikan Sunda Bandu',	'0.00',	'2',	'Saya masih menduduki kelas 11 di SMA Yayasan Atikan Sunda.\r\nSaya bersekolah SMP di MTS Manbaul Huda Bandung.\r\nSaya mengikuti ekskul Tataboga, English Club, Nasyid, Shurulkhan (bela diri islam), dan Tahsin Al Quran.\r\nSaya pernah menjadi ketua regu di acara Building Character ketika kelas 2 SMP.\r\nSaya bersekolah dasar di SD IT Persis Ciganitri.\r\nDi SD saya mengikuti ekskul angklung dan pramuka.\r\nSaya pernah mengikuti bela diri Tae Kwon Do selama 1 tahun ketika kelas 5 SD.\r\nSaya juga mengikuti lomba cerdas cermat dan juata 1 ketika kelas 6 SD.',	'Mimpi terbesar saya adalah menjadi pengusaha besar yang sukses.\r\nCara saya mewujudkannya adalah dengan bekerja keras, tidak mudah menyerah dan yakin terhadap diri sendiri.',	'Saya pernah menjadi anggota organisasi karang taruna di divisi menyiapkan kelangsungan acara lomba 17 agustus',	1,	1653569890,	NULL,	0),
('SCHLR-JSYL-6b350d',	'USR-JSYL-56f578',	'Jaisy Aulia',	'2005-04-22',	'882000246880',	'jl. Sapujagat Blok E4 No.132, Kel. Sukaluyu, Kec. Cibeunying Kaler\r\nKota Bandung, Jawa Barat.',	'IPS',	'SMA Yayasan Atikan Sunda Bandu',	'0.00',	'2',	'Saya masih menduduki kelas 11 di SMA Yayasan Atikan Sunda Bandung.\r\nSaya bersekolah SMP di MTS Manbaul Huda Bandung.\r\nSaya pernah mengikuti ekskul Tataboga, English Club, Memanah, Nasyid dan Shurulkan (bela diri islam).\r\nSaya bersekolah dasar di SDN Pelita Bandung selama 2 tahun lalu saya pindah ke SDN 2 Kota Serang selama 1 tahun kemudia saya pindah lagi ke SD IT Persis Ciganitri.\r\nPada saat kelas 5 SD saya pernah mengikuti bela diri yaitu Tae Kwon Do selama 1 tahun\r\nkemudia ketika kelas 6 SD saya mengikuti lomba cerdas cermat dan juara 1',	'Mimpi terbesar saya adalah menjadi pengusaha besar yang sukses.\r\nCara saya mewujudkannya adalah dengan saya bekerja keras, tidam mudah menyerah dan yakin terhadap diri sendiri.',	'Saya pernah menjadi anggota organisasi karang taruna di divisi menyiapkan kelangsungan acara lomba 17 Agustus',	1,	1653565280,	NULL,	0),
('SCHLR-JTMKB-a10a3f',	'USR-JTMKB-b5307',	'Jatmiko Budi Santoso',	'1996-07-18',	'895360845339',	'Minggiran Mj 2 No15 Rt 56 Rw15 Suryodiningrat Mantrijeron. Yogyakarta.',	'Psikologi',	'Sekolah Tinggi Psikologi Yogya',	'3.31',	'4',	'Saya pria yang suka dengan entertainment terutama di bidang musik dan host/MC. Saya sanguins.',	'Namatin kuliah S1 tepat waktu dengan gelar cumlaude, bekerja di barengi dengan kuliah S2, lalu menikah. Cara saya untuk mewujudkannya ya itu, memfokuskan pikiran saya terhadap studi saya dan pekerjaan paruh waktu saya. (Ojol)',	'Saya memiliki pengalaman organisasi pemuda RW, remaja Masjid di kampung saya, dan terkadang saya membantu kegiatan BEM di kampus.',	1,	1654148155,	NULL,	0),
('SCHLR-JTRBC-f5415a',	'USR-JTRBC-29112',	'Juita Urbach Hayati',	'2003-05-06',	'81335429065',	'Payaman Solokuro Lamongan',	'Kimia/Fakultas Sains dan Matem',	'Universitas Diponegoro',	'3.33',	'2',	'saya merupakan salah satu mahasiswa kimia undip angkatan 2021 yang kini tengah menduduki semester 2 dan tak lama akan menginjakkan kaki ke semester 3',	'menjadi orang dermawan, memberikan sedikit harta yang kumiliki kepada orang - orang yang membutuhkan ketika saya menjumpainy',	'iya, sejak SMP hingga saat ini saya memang suka banget terjun diorganisasi, karena bagi saya banyak nilai yanh dapat dipetik dari mengikuti organisasi tersebut, seperti dapat mengetahui cara memanage waktu dengan baik, bisa menerima sifat - sifat teman yang berbeda - beda dan masih banyak lagi',	1,	1655740227,	NULL,	0),
('SCHLR-KBRLF-46c627',	'USR-KBRLF-6d36a',	'Akbar Alfitho Rochim',	'2002-09-17',	'88213083984',	'Jl. Cijawura Girang 1 no 10 Kel. Sekejati Kec. Buah Batu Kota Bandung',	'Pendidikan Agama Islam/Fakulta',	'Universitas Islam Nusantara Ba',	'3.49',	'4',	'Aku adalah seorang anak dari pasangan bapa Komar Supriadi dan ibu Elnawati saya berasal dari Tangerang dan sedang melanjutkan jenjang pendidikan di salah satu kampus yang berada di daerah Bandung, Saya adalah anak kedua dari 3 bersaudara karena bapa dan ibu saya mengharapkan saya selaku anak kedua maka dari itu saya melanjutkan ke jenjang perkuliahan dengan dalih bisa agar bisa merubah perekonomian keluarga, dan semoga saya bisa membuktikan itu kepada orang tua dan tidak membuat sia sia mereka karna telah membiayai saya dari awal masuk sampai detik ini',	'Impian terbesar saya adalah ingin sekali mempunyai usaha sendiri dan juga bisa mengembangkan sendiri sampai akhir nya mempunyai anak buah sendiri, cara untuk mewujudkan nya dengan memulai memperbanyak relasi kepada orang yang telah sukses dengan usaha nya serta tak lupa di sertai dengan ibadah dan kunci utama nya berani maju',	'Sampai sekarang saya pun masih aktif di organisasi kampus baik internal maupun eksternal dalam organisasi saya banyak belajar karna pada dasar nya organisasi yang ada di kampus membawa kita kepada dampak positif dan memberikan kita relasi dan juga mengasah intelektual kita saya pun merasakan itu karna dalam lingkup organisasi yang saya ikuti itu ada yang namanya diskusi dan kajian guna menambah wawasan mahasiswa seperti itu ka',	1,	1653591888,	NULL,	0),
('SCHLR-KFJRN-c6eb90',	'USR-KFJRN-72ab2',	'Eka Fajrin Fahrezy',	'2001-12-27',	'82284423587',	'Jl Kinanti, Condongcatur, Yogyakarta',	'Teknik Sipil',	'Universitas Gadjah Mada',	'3.62',	'4',	'Saya merupakan orang yang senang dalam menuntut ilmu pengetahuan. Apabila saya sudah menentukan tujuan, saya akan kejar tujuan tersebut semaksimal mungkin. Saya juga orang yang suka berkompetisi sejak SMA. Selain itu, saya juga berusaha selalu mengembangkan diri saya menjadi pribadi yang lebih baik dengan mengambil pelajaran dari kejadian yang pernah saya alami ataupun yang dialami orang lain.',	'Tujuan hidup saya, yaitu menjadi orang yang bisa berguna bagi orang-orang sekitar dan bisa memberikan kontribusi dalam perkembangan dunia kedepannya. Saya termotivasi dari mendiang presiden RI kita yang ketiga,yaitu bapak BJ Habibie. Saya termotivasi akan kegigihan beliau menuntut ilmu dan kontribusi dia terhadap dunia, terutama dalam hal penerbangan. Saya berharap juga bisa memberikan kontribusi kepada dunia kedepannya sebelum saya wafat, terutama dalam bidang teknik sipil, seperti menemukan metode baru yang efektif dan efisien dalam suatu perancangan. Adapun cara saya mewujudkannya, yaitu belajar dengan giat baik ilmu yang didapat dari kuliah ataupun yang saya cari otodidak. Saya akan menerapkan ilmu yang saya dapatkan beserta pengalaman yang saya peroleh. Hal tersebut sebagai modal awal saya untuk mengembangkan inovasi dimasa yang akan datang.',	'Saya mengikuti organisasi didalam kampus yaitu organisasi pelayanan komputer teknik sipil dan civil study club. Kedua organisasi itu bergerak dalam bidang pelayanan kepada masyarakat sipil ugm dalam bidang komputer dan tutoring pelajaran. Saya di pelayanan komputer mendapat pengalaman dalam menyiapkan acara pelatihan software sipil dan membantu dalam pemasangan software tersebut. Selain itu, saya di civil study club pernah menjadi tutor kepada teman angkatan saya dalam persiapan Ujian Akhir Semester. Selain dua organisasi tersebut, saya juga pernah menjadi panitia lomba Civil Innovation Challange tahun 2020 kemarin sebagai anggota acara.',	1,	1654827015,	NULL,	0),
('SCHLR-KFSPR-8c5ac1',	'USR-KFSPR-53a2d',	'Kefas Prajna Christiawan',	'2001-12-10',	'85800021287',	'Perumahan Wahid, C2, Nomor 3, Rt.04, Rw.04, Kel. Kutowinangun, Kec. Tingkir. Salatiga. Jawa Tengah.',	'Ilmu Ekonomi',	'Universitas Gadjah Mada',	'3.39',	'4',	'Saya akan mengawali cerita tentang diri saya dengan perkenalan nama, Kefas Prajna Christiawa, berikut adalah nama saya. Kota Salatiga adalah tempat kelahiran dan tempat tinggal saya. Saat ini saya sedang menempuh pendidikan program sarjan (S1) di universitas impian saya sejak kecil, yaitu Universitas Gadjah Mada. Mengambil jurusan ilmu ekonomi adalah keinginan saya dikarenakan saya memiliki impian untuk dapat berkontribusi terhadap perekonomian dan kesejahteraan masyarakat Indonesia, terutama kelompok miskin dan pertanian. Karakter yang melekat pada diri saya adalah pantang menyerah, dermawan, dan dapat memimpin. Bukti dari karakter saya adalah saat ini saya berhasil diterima di salah satu PTN terbaik di Indonesia, tetapi prosesnya penuh dengan banyak kegagalan terlebih dahulu. Selain itu, sejak kecil saya selalu diajarkan untuk menolong sesama, saat ini saya menyisakan uang pendapatan saya untuk menolong orang lain. Walaupun tidak terlalu besar, tetapi saya berharapa tetap dapat bermanfaat bagi orang lain. Untuk karakter kepemimpinan, saya dipercaya untuk memegang mandat menjadi pemimpin Redaksi di Badan Penerbitan dan Pers Mahasiswa Equilibrium FEB UGM. Semua ini tidak akan terjadi tanpa adaya usaha dan kegagalan di awal yang menjadi pelajaran. Saya merasa memiliki kelebihan di bidang kepenulisan, olahraga, dan bernegosiasi dengan orang lain. Skill analisis dan menulis menjadi modal untuk mengasah karir saya di bidang jurnalistik, kajian, dan penelitian. Walaupun saat ini, saya mendapatkan tunjangan dari orang tua terkait finansial. Namun, saya membuka suatu bisnis pribadi di bidang reseller sepatu olahraga, bisnis ini berdiri dari keresahan saya terhadap susahnya mencari sepatu olahraga yang berkualitas dengan budget minimalis bagi atlet bola basket di Kota Salatiga dan Indonesia. Dari bisnis ini saya dapat mengurangi beban orang tua saya dengan adanya pendapatan tambahan, serta mengembangkan skill negosiasi yang saya miliki dalam menyelesaikan masalah, mencari kesepakatan, dan berhubungan dengan bermacam-macam karakter orang. Membahas mengenai keluarga, ditengah kesederhaan keluarga saya, tetapi saya memiliki waktu untuk berdiskusi dengan orang tua dan kakak (saya memiliki satu orang kakak perempuan) saya terkait isu-isu terkini yang beredar. Di sektor akademik, saya berusaha bertanggung jawab sepenuhnya di tengah kesibukan organsiasi dan bisnis yang saya jalankan, hal ini cukup dibuktikan dengan IPK saya sebesar 3.9. Namun, saya menginginkan lulus cumlaude dari FEB UGM. Berikut adalah sekilas tentang diri saya, saat ini saya memiliki harapan untuk dapat terus mengembangkan skill dan potensi yang saya miliki dengan mengikuti program YBB Scholarship ini. Maka, besar harapan saya untuk memiliki kesempatan bergabung sebagai awardee YBB Scholarship. Terima kasih. ',	'Saya memiliki mimpi terbesar untuk dapat menjadi ekonom di bidang kemiskinan dan pertanian, dimana saya dapat membantu meningkatkan kesejahteraan masyarakat miskin, marjinal, terpinggirkan, dan petani. Maka dari itu, di masa mendatang saya memiliki harapan untuk dapat bekerja di lembaga penelitian seperti Smeru atau instansi pemerintah TNP2K, kementrian, dan lainya. Namun, saya paham apabila jalan menuju impian saya tidaklah mudah, saya memerlukan usaha dan dedikasi yang kuat. Maka dari itu, sejak saat ini saya tergabung di departemen kajian dan penelitian (DKP) Himpunan mahasiswa Ilmu ekonomi FEB UGM. Pada organisasi ini, saya mengasah potensi menulis, kajian, dan penelitian saya di bidang kemiskinan dan pertanian. Selain itu, saya juga mengasah dengan menjadi pemimpin redaksi di Badan Penerbitan dan Pers Mahasiswa Equilibrium FEB UGM, di organisasi ini saya dituntut untuk dapat membela kepentingan kaum lemah, seperti mahasiswa, petani, masyarakat miskin, dan lainya melalui tulisan yang kami publikasikan. Contoh dari beberap judul tulisan yang sudah saya terbitkan adalah Membahas Kebijakan yang Tepat untuk Konflik Global Katalis Kenaikan Harga CPO dan CO, huru-Hara demonstrasi: Suara Rakyat Melalui Mahasiswa, Indonesia Poverty Condition: The Responsibility of Education, Peranan Agrikultur dalam Menekan Kemiskinan: Studi Kasus Beberapa Negara Termasuk Indonesia, dan lainya. Selain itu semua, usaha saya adalah mencoba mengikuti lomba, saya pernah menjadi best delegation dari acara Digicon BEM KM UGM. Dimana acara ini mencoba mencari solusi untuk menyelesaikan masalah internal di UGM. Hal yang terakhir adalah tetap fokus pada proses pembelajaran, meminta restu orang tua, dan berdoa pada Tuhan agara selalu diberi kemudahan dan hasil yang terbaik. ',	'Saat ini saya mengemban tugas di 2 organisasi, yaitu Badan Pers dan Penerbitan Mahasiswa (BPPM) Equilibrium FEB UGM dan Departemen Kajian dan Penelitian (DKP) Himpunan Mahasiswa Ilmu Ekonomi dan Studi Pembangunan FEB UGM. Pada dua organisasi tersebut, saya menjabat sebagi pemimpin redaksi di BPPM Equilibrium dan staff ahli penelitian di DKP. Saya mengasah potensi saya di bidang kepenulisan, kajian, dan penelitian. Seperti yang sudah saya ceritakan di mimpi terbesar saya, di organisasi tersebut saya sudah menulis banyak artikel, seperti Membahas Kebijakan yang Tepat untuk Konflik Global Katalis Kenaikan Harga CPO dan CO, huru-Hara demonstrasi: Suara Rakyat Melalui Mahasiswa, Indonesia Poverty Condition: The Responsibility of Education, Peranan Agrikultur dalam Menekan Kemiskinan: Studi Kasus Beberapa Negara Termasuk Indonesia, dan lainya. Organisasi lainya yang pernah saya ikuti adalah staff Marketing and Communication di event terbesar di ekonomi UGM yaitu FSDE, dimana acara ini akan mengadakan seminar dengan pembicara top, seperti Wakil Presiden, menteri, Gubernur Bank BI, Direktur BUMN, atau perahian nobel ekonomi. Saya memiliki tugas untuk menyiapkan konten dan mengurus sosial media, serta memasarkan acara ini agar sesuai target audiens. Pada pengalaman relawan, saya pernah tergabung dengan Satu Ikatan untuk Salatiga (SIKAT) dimana organisasi ini berusaha membantu pemerintah dalam menanggulangi Covid-19 dengan mencoba mencarikan peralatan medis dan bantuan sosial bagi rumah sakit daerah di Kota Salatiga. Berikut adalah pengalaman saya sejauh ini. ',	1,	1655745329,	NULL,	0),
('SCHLR-KGSBD-e3bab2',	'USR-KGSBD-c2855',	'Kgs Abdul Rasyid',	'2003-05-01',	'85380151139',	'Jalan Semeru No 565, Kelurahan 17 Ilir, Kecamatan Ilir Timur 1, Kota Palembang',	'Jurusan Manajemen',	'Universitas Sriwijaya',	'4.00',	'2',	'Perkenalkan nama saya Kgs Abdul Rasyid, dan saat ini saya merupakan mahasiswa manajemen semester dua di Universitas Sriwijaya, dengan pengalaman menganalisa produk dan market, mengembangkan produk, manajemen proyek, volunteer, dan campus ambassador. Saya senang belajar di sini, terutama karena dapat berkenalan dengan banyak teman dari berbagai daerah juga dapat mempelajari manajemen dan bisnis. Saat ini saya menghabiskan banyak waktu di luar studi saya mengikuti volunteer, internship, mentoring dan aktif dalam organisasi seperti AIESEC. Saya juga pernah menulis dan posting microblog di akun instagram saya mengenai \"metaverse\" dan prospek perkembangannya di masa depan. Saya juga adalah seseorang yang sangat tertarik dengan administrasi, inovasi teknologi, manajemen proyek, otomotif dan pemasaran. Oleh karena itu, saya sangat senang untuk menerapkan dan membagikan apa yang sudah saya ketahui dan miliki kepada orang lain, sehingga menjadi sangat bermanfaat untuk membantu orang yang membutuhkan.\r\n',	'Mimpi terbesar saya adalah ingin mendirikan perusahaan startup saya sendiri yang bergerak di bidang kebersihan dan lingkungan dengan menciptakan produk kotak sampah yang terintegrasi dengan IoT pada perangkat pintar demi mewujudkan SDGs no 12 dalam upaya mengurangi dampak lingkungan yang ditimbulkan oleh manusia melalui pola produksi dan konsumsi yang sewajarnya dan dapat mewujudkan kesejahteraan warga. Cara saya mewujudkan mimpi saya adalah dengan aktif mengikuti organisasi saya (AIESEC) yang dimana peduli dengan SDG\'s ini, aktif mengikuti volunteer (seperti Musi Zero Waste Local Volunteer), dan seminar berkaitan dengan kebersihan atau juga teknologi terbarukan yang ramah lingkungan.\r\n',	'Iya saya mempunyai pengalaman organisasi, untuk sekarang ini contohnya saya tengah aktif organisasi di AIESEC in UNSRI sebagai staff outreach di departemen external relations. Tugas saya disana untuk saat ini adalah market research lebih dari 50 calon partner seperti influencer potensial, media potensial, komunitas potensial, menjaga hubungan dengan lebih dari 10 partner untuk sekarang ini, bersinergi dengan departemen lain, menjadi PIC dalam projek fundraising bersama partner, mengikuti acara yang diselenggarakan partner, membuat event kolaborasi dengan partner, dll. Untuk relawan atau volunteer saya sebagai project manager volunteer di Peduly, disana saya Sebagai kepala event manager di divisi project manager dalam membuat, mengarahkan, mengkoordinasikan, mengawasi, membantu mengatur dan mensukseskan acara hingga akhir. Tak hanya itu program pekerjaan kami pun juga berhasil seperti membuat proyek penggalangan dana untuk korban gempa di salah satu provinsi terdampak di Indonesia dengan mengumpulkan donasi lebih dari Rp 1.150.000+ dan membuat proyek “Jumat Berkah” dan berhasil memberikan bantuan sosial berupa makanan dan minuman kepada masyarakat dan jalan anak-anak dengan donasi yang terkumpul dari internal organisasi lebih dari Rp 700.000+.\r\n',	1,	1654506323,	NULL,	0),
('SCHLR-KHFFH-1622b5',	'USR-KHFFH-06c26',	'Khofifah',	'2004-06-17',	'85741727048',	'Jl. Gotong royong, lr. Rambutan, Talang Jambe, kec. Sukaramai, kota Palembang, prov. Sumatera Selatan',	'Ips',	'MA Aulia Cendekia',	'8.00',	'2',	'Hallo, saya Khofifah seorang pelajar SMA yang baru saja naik ke kelas 12 dengan jurusan IPS. Kesibukan saya selain sekolah, saya juga aktif diberbagai organisasi baik online maupun offline, tak hanya itu saya juga tekun mengasah skill yang saya miliki, seperti public speaking, listening well, dan leadership. Untuk itu saya biasa mengikuti kelas pelatihan online untuk mengasah skill saya, dan ikut kompetisi untuk mengetahui batas kemampuan yang telah saya latih. ',	'Mimpi terbesar saya adalah menjadi anak muda yang membanggakan dan selalu mau berkembang melalui hal-hal dan skill yang saya miliki. \r\nSeperti saya ingin menjadi public speaker yang memotivasi, maka saya belajar, dan berlatih tentang public speaking, mengikuti pelatihan, dan berlomba. \r\nBelajar sesuatu dari membaca buku juga saya lakukan, seperti buku Bicara itu ada seninya, Komunikasi itu ada seninya, karya oh su hyang seorang pakar komunikasi di Korea Selatan, dari buku-buku ini saya belajar dan berlatih untuk public speaking. \r\nKunci terbaik untuk mewujudkan mimpi yang besar adalah mau belajar, berlatih, berkompetisi, dan mengajarkannya pada yang belum mengerti atau mengetahui. \r\nSelain itu saya juga ingin mendapatkan beasiswa kuliah ke luar negeri dengan kemampuan yang sedang saya asah, yaitu bahasa Inggris. Karena yang saya tau kalau kita tidak menguasai bahasa negara itu maka setidaknya kita bisa bahasa Inggris untuk TOEFL/IELTS. Dari sekarang saya sudah mulai mendalami bahasa inggria baik melalui film, lagu, dan podcast. \r\nYang terpenting bagi saya mimpi besarnakan terwujud jika mimpi kecil atau hal-hal kecil yang bersangkutan dengan mimpi besar itu diwujudkan, jika mimpi kecil saja belum tercapai bagaimana mau mencapai mimpi yang besar?',	'Iya ada, saya aktif di organisasi offline yakni, Komunitas Narasi Sumatera Selatan, yang mana salah satu foundernya adalah mbak Najwa Shihab, di Komunitas ini saya belajar untuk speak up, peduli politik, sosial, dan isu-isu yang sedang booming di Sumatera Selatan. Dan, kami pernah kolaborasi dengan komunitas lain menjadi relawan pada saat peristiwa meletusnya gunung Sumeru, kami mengadakan sumbangan untuk korban bencana dengan meminta pada masyarakat palembang di tiap titik lampu merah. \r\nSaya juga aktif di organisasi online, seperti pemimpin pintar (dari aplikasi Aku Pintar) organisasi ini berisi pelajar SMA dan ada beberapa Mahasiswa yang aktif dan peduli soal education, disitu kami belajar dan mendalami tentang pemilihan jurusan, mengasah skill untuk bekal masa depan, kami juga sebulan sekali diadakan webinar atau kelas pelatihan skill, seperti beberapa waktu yang lalu tentang skill  make up art, mental health, public speaking, dan masih banyak lagi ilmu yang diberikan melalui aplikasi zoom. Tak hanya itu Pemimpin Pintar juga membuka peluang untuk anggotanya yang ingin menjadi MC di tiap agenda webinar, dan salah satu MC (pembawa Acara) nya adalah saya yang lolos seleksi, di organisasi ini saya telah bergabung selama 1 tahun, begitu juga dengan MC nya. \r\nKalau di sekolah saya juga aktif di organisasi IPNU, dan mendapat jabatan sebagai pengurus bagian pendidikan/keilmuan. Beberapa bulan yang lalu sekolah saya mengadakan webinar tentang pelatihan skill organisasi yang pembicara nya keren-keren, dan saya berkesempatan dua kali untuk bertanya dengan keberanian saya untuk speak up dan meminta pendapat dari pembicara yang keren-keren itu. \r\nAktif nya saya diberbagai organisasi dan komunitas tidak menjadikan saya lupa untuk tugas sekolah, di kelas saya tetap menjadi anak yang aktif dan tetap mendapat rangking 1, dengan kemampuan management waktu, dan ketekunan saya serta rasa tanggungjawab untuk tidak meninggalkan kewajiban saya sebagai pelajar. \r\n',	1,	1655719892,	NULL,	0),
('SCHLR-KHLFT-416500',	'USR-KHLFT-d7aae',	'Kholifatul Ibra Tyra Zahrani',	'2004-04-02',	'85231135798',	'Purworejoregency blok G-50, sanankulon,kab.Blitar',	'Kesehatan Maayarakat',	'Universitas Airlangga',	'0.00',	'0',	'Saya meeupakan anak pertam sehingga mau tidak mau membentuk diri saya sebagai orang yang mandiri, ambisius, dan harus bisa menjadi contoh yang baik. Pedulinya orang tua saya terhadap pendidikan sehingga waktu saya dihabiskan dengan belajar dan saya ungguk di akademik. Karena itulah saya sangat ambisius dalam mencapai sesuatu ',	'Mimpi terbesar saya yaitu bisa melanjutkan pendidikan saya sampai S-3 dan saya ingin memiliki kesempatan untuk belajar di luar negri kampus top 100 dunia. Saya benar-benar ingin menjadi wanita yang berpendidikan tinggi sehingga cara berpikir saya nantinya dapat bmenjadi lebih baik. Cara saya untuk mewujudkannya yaitu belajar lebih giat lagi, membuat plan yang nantinya harus saya selesaikan, dan menjalin relasi ke semua pihak. Apply beasiswa juga salah satu usaha saya agar nantinya orang tua tidak terbebani dengan impian saya.',	'Iya, saya memiliki pengalaman organisasi di paskibra menjadi pembuat materi. Pembuat materi ini bertugas menyusun materi agar terasa efektif dan dapat menyelesaikan target yang telah dibuat. Maka, management yang bagus sangat diperlukan dalam tim ini. Apalagi pada saat itu mengalami covid-19 sehingga itu merupakan salah satu tantangan terbesar kami bagaimana materi tetap beejalan lancar.',	1,	1655694563,	NULL,	0),
('SCHLR-KHRN-f1f8ea',	'USR-KHRN-315d38',	'KHAIRANI',	'2003-11-30',	'81270459417',	'Dusun III BAYEUN SETIA Desa Padang panjang kec Susoh kab Aceh barat daya',	'Ipa',	'SMAN 1 ACEH BARAT DAYA',	'9.64',	'5',	'Nama saya Khairani dan akrab dipanggil dengan nama Rani.Saya lahir pada 30 \r\nNovember 2003 di kota Medan, Sumatera Utara.Saya tinggal di kota aceh barat \r\ndaya tepatnya diprovinsi Aceh .Saya sekolah di SMAN 1 Aceh Barat Daya \r\n.Berasal dari keluarga sederhana yang berharap anak-anak bisa sukses meraih \r\npendidikan tinggi .',	'Hidup harus punya tujuan! Prinsip ini harus dimiliki oleh setiap orang, jika \r\ntidak akan kehilangan arah. Saya sendiri tentunya harus menetapkan tujuan \r\nhidup saya .Walaupun tujuan hidup saya belum terlalu spesifik, tetapi saya \r\nmemiliki tujuan hidup secara garis besar.Untuk jangka pendek ini, tujuan saya \r\nadalah belajar dengan baik, belajar banyak hal positif, dan bisa kuliah di \r\nUniversitas gadjah mada dengan bantuan beasiswa. Pasti tujuan jangka pendek \r\nini harus mendukung tujuan jangka menengah saya .Untuk jangka menengah,\r\nsaya ingin lulus tepat waktu dari kampus impian dan mendapatkan pekerjaan\r\nyang mapan sesuai dengan keahlian dan minat saya. Untuk mendapatkan hal \r\ntersebut, oleh karena itu saya harus bisa mencapai tujuan jangka pendek hidup \r\nsaya tadi .Pasti tidak ada tujuan hidup tadi jika saya hanya melakukannya untuk \r\ndiri sendiri.Saya hanya ingin menjadi orang yang bermanfaat bagi orang sekitar \r\nsaya. Setiap langkah yang saya pilih, saya ingin langkah tersebut memberikan \r\nkebahagiaan bagi orang lain.Pasti setelah mencapai tujuan jangka menengah \r\ntadi, saya juga harus melakukan hal yang bermanfaat bagi orang lain. Saya ingin \r\nberwirausaha agar dapat memberikan pekerjaan bagi orang lain, karena salah \r\nsatu masalah terbesar di negeri ini adalah gerakan. Setelahnya saya ingin \r\nmembuat yayasan pendidikan untuk anak-anak yang kurang mampu. Karena \r\nmenurut saya, untuk memperbaiki negeri ini harus melalui pendidikan yang baik sejak dini bagi calon penerusnya. Tujuan jangka panjang saya adalah untuk \r\nmembahagiakan orang tua saya dan keluarga besar saya, serta membuat orang \r\ntua saya bangga. Pastinya tujuan tersebut yaitu juga untuk mendapatkan ridho \r\nAllah SWT. dan masuk surga. Karena kita sebagai manusia nantinya akan kembali kepada-Nya',	'Iya saya pernah memiliki pengalaman saat masa SMA .',	1,	1655700810,	NULL,	0),
('SCHLR-KHRNS-28b32d',	'USR-KHRNS-faa56',	'Khoiri Anshori Tanjung',	'2004-06-09',	'81378839139',	'Panorama Baru, Puhun Pintu Kabun, kecamatan Mandiangin koto selayan, Kota Bukittinggi',	'Keagamaan',	'Madrasah Aliyah Sumatera Thawa',	'9.10',	'1',	'Berkaitan dengan diri saya,saya memiliki kelebihan dan kekurangan, diantara nya saya memiliki kemampuan publik speaking yang baik,kemampuan ini memberikan efek yang positif bagi diri saya sehingga mempermudah untuk bersosial dalam kehidupan ini,bahkan dengan publik speaking ini saya mampu memimpin dan mengarahkan roda organisasi, diantara kelemahan yang saya miliki,saya kurang menyukai dunia sastra akan tetapi bukan tidak bisa untuk bersastra karena ini kekurangan yang saya miliki tetapi saya bisa meyakinkan bahwa mampu juga bersastra,bukan tidak bisa tapi tidak prioritas.',	'Saya memiliki mimpi menjadi seorang akademisi yang baik sehi6 dapat mendidik bangsa dan para pemuda di negara ini untuk berpikir kritis dan teoritis sehingga dapat menga7 negara dan bangsa ini kearah yang positif,tidak hanya itu saya juga akan menulis sebuah buku yang dapat memberikan kritikan dan aspirasi terhadap negara ini,di lain itu juga saya akan menciptakan lapangan pekerjaan sehingga dapat memberikan waktu dan kesempatan bagi para pemuda untuk bersaing di dunia kerja.baik dalam kanca nasional ataupun internasional.',	'Berkaitan pengalaman organisasi,saya pernah berkontribusi dalam 4 organisasi dalam kurun waktu 3 tahun belakangan ini,baik yang bergerak di bidang sosial dan kemasyarakatan,juga bidan edukasi dan kreativitas,,serta bidang penul6 dan literasi, salah satu organisasi yang saya pimpin langsung yaitu bidang literasi dan penulisan yaitu forum literasi santri, organisasi memberikan efek yang baik bagi siswa di sekolah saya sehingga organisasi dapat menambah ilmu para siswa.',	1,	1654833949,	NULL,	0),
('SCHLR-KHRSM-54bcb9',	'USR-KHRSM-9eede',	'Kharisma Aulia Safitri',	'2003-08-14',	'88286059144',	'Jl. Makam KH gholib pringsewu, lampung',	'Farmasi',	'Poltekkes Kemenkes Tanjungkara',	'3.41',	'2',	'Saya adalah mahasiswi jurusan D3 farmasi Poltekkes Kemenkes Tanjungkarang, saya kuliah dengan keinginan dan keyakinan diri untuk menjadi sukses dan bisa membanggakan orang tua, saya mampu mengerjakan dan mengikuti setiap kegiatan dan pelatihan di kampus yang sama jalani',	'Saya ingin menjadi seorang TTK yang dapat membantu setiap orang yang membutuhkan bantuan, cara saya untuk mewujudkannya adalah dengan saya berusaha dan selalu belajar dan sering sharing ke dunia luar supaya bisa mengembangkan diri',	'Saya pernah mengikuti unit kesehatan sekolah yang dimana disitu saya dapat membantu orang dan mengerti bagaimana cara mengobati orang yang sedang sakit',	1,	1655741381,	NULL,	0),
('SCHLR-KHRTR-659016',	'USR-KHRTR-66c06',	'Khori tirta wijaya',	'2003-05-02',	'882006319412',	'Besole,panggungan,trihanggo,gamping,sleman, DIY',	'Pendidikan Kriya',	'Universitas Negeri Yogyakarta',	'3.45',	'2',	'Saya suka memahami hal-hal baru terkait ilmu seni, karna menurut saya hidup tidak akan indah tanpa adanya unsur seni. Seni merupakan pemanis dalam kehidupan saya maka dari itu saya bertekat ingin menjadi guru menebarkan ilmu keindahan pada generasi penerus bangsa',	'Saya hanya ingin membahagiakan kedua orang tua saya, dengan meringankan biaya kuliah yang mana itu cukup memberatkan kedua orang tua saya ',	'Waktu sma saya mengikuti paduan suara yang mana itu melatih jiwa percaya diri, kepemimpinan, dan hal-hal lain yang terkait dengan hal tersebut',	1,	1653668255,	NULL,	0),
('SCHLR-KKSTR-8b7e6f',	'USR-KKSTR-b0d21',	'Kaka Satria Pratama',	'2004-07-19',	'85860755796',	'Jl. Parakan Saat No.64, Rt.002/Rw.011, Kelurahan Cisaranten Endah, Kecamatan Arcamanik, Kota Bandung, Jawa Barat, Indonesia 40295',	'Pendidikan Khusus Fakultas Ilm',	'Universitas Pendidikan Indones',	'0.00',	'1',	'Salam Hangat bagi pengurus dan panitia Beasiswa Pemuda YBB,\r\nPerkenalkan,nama saya Kaka Satria Pratama,sering dipanggil dengan panggilan Satria ataupun Kakang.Saya adalah Lulusan SMAN 23 Kota Bandung dan kini Mahasiswa Baru di Universitas Pendidikan Indonesia Jurusan Pendidikan Khusus.\r\nSaya memiliki hobby dalam bidang menulis dan berorganisasi. Khususnya,saya menyukai dalam kategori Cerita Pendek maupun penelitian tertulis dalam bidang menulis.\r\n\r\nSaya menyukai organisasi sudah sejak awal masuk SMA karena organisasi begitu penting bagi kerja impinan saya khususnya yang bergerak pada bidang pendidikan dan sosial. Saya adalah anak pertama dari dua bersaudara. Dan,ibu saya adalah single fighter bagi kedua anaknya yang dimana ayah saya sudah wafat sejak Februati 2020 yang berawal dari sakit parah sejak  Januari 2020. \r\n\r\nIbu saya juga ter-PHK pada Maret 2020 karena adanya pandemi Covid - 19 yang menyebabkan keseluruhan ekonomi menurun drastis. Ibu saya pun Merintis jualan sembako dan GoFood dan GrabFood.Berawal dari sebuah moda yang diberikan teman kerja ibu dan mempunyai potensi bagus untuk tetap bertahap dalam keadaan ekonomi yang tidak stabil.\r\n\r\nAku juga sering membantu mengantarkan ibu membeli barang sembako, mengantarkan barang sembako kepada pembeli,dan membantu pekerjaan rumah lainnya seperti mencuci piring,membersihkan debu rumah ,dan sebagainya.\r\n\r\nIbu yang menjadi panutanku sampai sekarang karena ibuku yang selalu kuat dan bisa memanajemen waktunya dalam pekerjaan dengan anak - anaknya. \r\n\r\nJiwa pantang menyerah dan melawan dari sisi minder yang membuatku salut kepada ibu-ku ',	'Tujuan hidup saya adalah untuk Hajat Hidup Manusia. Di saat saya sudah wafat nanti, saya ingi dikenang dengan baik dan merasa kebermanfaatan yang saya berikan untuk seluruh manusia, terutama untuk Pendidikan di Indonesia dan Dunia. Salah satu usaha atau jalan saya menuju meraih kebermanfaatan yang bisa dibagikan adalah mengikuti Self-Development bersama Beasiswa Pemuda YBB. \r\n\r\nSaya memiliki impian terbesar untuk menjadi seorang orang yang menjalankan sebuah pendidikan lebih merata dan lebih sejahtera serta adil bagi anak - anak bangsa Indonesia dan dunia. Dengan saya memiliki impian terbesar dalam menjadi penggerak pendidikan, saat ini saya tergabung dalam beberapa organisasi dan melakukan penelitian secara tertulis teruama dalam bidang pendidikan. Yang dimana, saya menuangkan ide - ide yang saya punya dalam sebuah penelitian dan berharap solusi yang saya buat bisa berguna untuk masyarakat. \r\n\r\nSaya percaya dengan saya mendapatkan Beasiswa Pemuda YBB dan mempunyai wadah atau forum diskusi bersama pemuda - pemuda Pelajar Juara lainnya, saya mendapatkan banyak peluang baru untuk menggapai impian saya serta dampak - dampak yang saya akan memberikan hal positif dan berharga bagi saya dan masyarakat juga. Selain itu, sesi pengembangan diri yang diberikan beasiswa ini benar benar memberikan wawasan yang lebih luas sehingga para kontributor Beasiswa Pemuda YBB akan semakin didukung akan bantuan dan kolaborasi akan menciptakan sesuatu hasil yang luar biasa.\r\n\r\nDengan begitu,saya memiliki motivasi untuk mendaftarkan diri atau mempunyai seorang mentor yang berguna bagi impian saya saat kini dan membawakan yang terbaik untuk orangtua saya. Lalu,saya melihat sebuah program belajar Self-Development atau yang sangat penting untuk kemajuan atau perkembangan karir impian saya semakin matang. Lantas,saya langsung termotivasi untuk mendaftarkan diri di Beasiswa Pemuda YBB yang digunakan untuk melakukan pengembangan diri.\r\n\r\nLalu,apa motivasi mendaftarkan program ini ? Motivasi saya mendaftarkan sebaai calon penerima dalam program yang dilakukan oleh Beasiswa Pemuda YBB adalah ingin melakukan pengembangan diri dan mengembangan atau mengeksplor diri saya lebih jauh. Dengan mentor-mentor yang terbaik dalam mengajarkan saya bagaimana mengimplementasikan langsung tentang Self-Development secara menarik dan benar,saya percaya bahwa saya mendapatkan pengembangan diri luar biasa untuk menjadi seorang pemuda yang memiliki jiwa muda dan terus berprestasi.\r\n\r\nRencana dalam satu tahun ke depan yang akan saya bangun adalah saya berkeinginan besar untuk membangun sebuah networking dalam skala nasional dan  internasional untuk menjangkau relasi internasioanl dan membangun atau mengembangkan program-program yang fokus dalam bidang Pendidikan. Saya juga akan memberikan dedikasi yang terbaik untuk menjadi pemuda yang lebih berkompeten dan tentunya dengan bantuan Beasiswa Pemuda YBB akan semakin memudahkan sebagai pemuda yang lebih unggul dan bisa memberikan literasi mengenai Self-Development yang baik kepada orang lain.\r\n\r\nKeterbatasan Ekonomi , Keterbatasan Elektronik, dan segala keterbatasan di pandemi ini bukanlah halangan bagi saya untuk menerima program ini sebaik mungkin. Justru, ini menjadi penyemangat bagi saya untuk membuktikan bahwa Seorang Introvert bukanlah hal yang menunjukkan Kekurangan, tetapi Kelebihan dalam diri saya yang bisa berbagi kebermanfaatan bagi banyak orang. \r\n\r\nSaya seringkali bantu orang tua untuk berjualan dan tanpa adanya seorang ayah sejak tahun 2020, membuat saya semakin bersemangat untuk membantu segala yang dibutuhkan oleh keluarga saya seperti mengikuti beasiswa-beasiswa.\r\n\r\n\"If You Believe, Whatever You Can Achieve\" ucap Tony Robbins yang berhasil menginspirasi saya untuk percaya diri.\r\n\r\nDiri saya sangat kurang dalam kepercayaan diri karena mengalami masa kelam yaitu bully-an atau pengucilan sejak SMP. Tetapi, seiring saya mengikuti rangkaian penyeleksian beasiswa, video motivasi, dan mengikuti organisasi nasional maupun internasional membuat setiap pengalaman tersebut sangatlah berharga dan mengartikan apapun yang saya raih saat kini, tentunya akan sangat bermanfaat bagi banyak orang, jika dipelajari sebaik mungkin dari awal - akhir!\r\n\r\nSesuai dengan nama beasiswa-nya \"Beasiswa Pemuda\", beasiswa yang mempersiapkan pemuda-pemudi Indonesia untuk berkolaborasi menjadi berbakat,cerdas, dan sangat kreatif. Kolaborasi inilah yang menjadi semangat saya untuk mendaftarkan diri untuk Beasiswa Pemuda YBB. Saya ingin berkenalan dan saling berbagi inspirasi dengan pemuda-pemudi yang tersebar dari Sabang - Merauke. Terutama, saya ingin menjadi pemuda-pemudi Indonesia yang berhasil mencapai cita-cita nasional dan mempersiakan Indonesia Emas 2045\r\n\r\nSelain itu, dengan adanya beasiswa, saya bisa melatih soft-skill dan mempersiapkan dunia perkuliahan maupun dunia pekerjaan di masa depan yang terbaik. Seperti, melatih Public Speaking dan Self-Confidence untuk menyampaikan aspirasi yang bisa \'dicintai\' dan \'bermanfaat\' bagi hajat hidup manusia. Beasiswa Pemuda YBB juga sebagai wadah untuk inovasi dan kreativitas anak di bidang berbagai bidang seperti pendidikan, yang dimana termasuk dalam bidang yang paling termotivasi yang kini saya jalani.\r\n\r\nTerakhir, tentunya dengan adanya beasiswa, akan sangat membahagiakan orang tua saya. Membantu perekonomian keluarga dan juga hal pendidikan yang saya harapkan. Karena, saya berasal dari keluarga yang Kurang Mampu tetapi semangat untuk membantu segala yang dibutuhkan oleh adik dan ibu saya tidak pernah berhenti melainkan terus bekerja sebaik mungkin dengan mengevaluasi diri. \r\n\r\nBeasiswa Pemuda YBB memotivasi saya untuk meraih kesempatan sebaik mungkin dan juga menjadikan segala impian saya terwujud bersama-sama dengan Awardee Beasiswa Pemuda YBB untuk Indonesia dan Dunia .\r\n\r\n\"Pendidikan adalah sebuah langkah yang harus / wajib ditempuh dengan segala upaya dan daya agar bisa keluar dari jerat kemiskinan\" \r\n\r\nItu adalah kalimat yang selalu menjadi inspirasi diri saya memperjuangkan masa depan yang terbaik untuk keluarga saya. Semoga di masa depan saya bisa membangun Yayasan Pendidikan yang membina Karakter, Budi Pekerti, Akademik, dan Prestasi dari anak SD - Mahasiswa yang bernamakan \"Pratalit\'s Company untuk membangun Indonesia yang lebih maju dan makmur serta merata keadilan untuk seluruh Rakyat Indonesia. Demi Kualitas Pendidikan Indonesia yang lebih Baik.\r\n',	'1. Anggota Divisi Event Organizer Indonesia Bergerak periode Mei - Agustus 2021\r\n2. Social Media Maintenance Officer Anak Sekolah Indonesia periode November 2020 - November 2021\r\n3. Staff Departemen Saraswati Pelajar Sastra Jawa Barat periode Januari 2021 - Sekarang\r\n4. Student Ambassador Memetik Edu Indonesia periode Februari - November 2021\r\n5. Student Ambassador Magnify Wellness periode Maret - Juni 2021\r\n6. Social Media dan Ambassador Team TheChatterGals periode Juni - Oktober 2021\r\n7. Social Media dan Website Team Patahkan Sekat Indonesia periode Juli 2021 - Sekarang\r\n8. Content Writer D-Day Team Inefabble Gen Z Indonesia periode Agustus - Oktober 2021\r\n9. Public Relation Ruang Asuh periode Agustus - Oktober 2021\r\n10. Leader Abhi Satya Indonesia periode September 2021 - Sekarang\r\n11. Wakil Ketua Scholarship Team Ruang Internasional periode Oktober - Desember 2021\r\n12. Relawan Ruangpeduli Bidang Media & Publikasi Kreatif periode Januari - Mei 2022.\r\n13. Anggota Divisi Content Writer TR Education periode April 2022 - Sekarang',	1,	1655745634,	NULL,	0),
('SCHLR-KLLMN-0a2d77',	'USR-KLLMN-bc09f',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654590720,	NULL,	0),
('SCHLR-KLMYQ-8d6d9d',	'USR-KLMYQ-c22b6',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654007887,	NULL,	0),
('SCHLR-KLMYQ-db6689',	'USR-KLMYQ-892e7',	'Kalimaya Qolbi Sani',	'2003-08-30',	'81326794412',	'Tempel RT 06 RW 01, Sumberagung, Klego, Boyolali, Jawa Tengah',	'Teknik Kimia',	'Universitas Sebelas Maret',	'3.84',	'4',	'Nama saya kalimaya qolbi sani. saya biasa dipanggil maya. Saya merupakan mahasiswa semester 4 jurusan Teknik Kimia. Kesibukan saya sekarang adalah mengikuti perkuliahan dan penelitian terkait sintesis nanopartikel ZnO dari baterai dan pembuatan biopolybag dari tandan kosong kelapa sawit. Disamping itu, saya juga mengikuti unit kegiatan mahasiswa di bidang keilmiahan di tingkat jurusan yaitu CERC sebagai head of human resources dan keilmiahan tingkat universitas yaitu SIM sebagai staff of human resources. Saya adalah Saya adalah pribadi yang aktif, rajin, menyukai tantangan, suka mencoba hal baru serta mampu mengatur waktu dengan baik. Hal tersebut dapat dilihat dari kesibukan saya sehari-hari seperti mengikuti perkuliahan, unit kegiatan mahasiswa, menjalani hobi, kepanitiaan, dan mengikuti perlombaan.',	'Saya membayangkan saya bisa menjadi seorang Research and Development (R&D) di suatu perusahaan dalam 5 tahun ke depan. Saya ingin menjadi sosok R&D berkepribadian luhur yang bisa membangun peradaban 270 juta warga Indonesia menjadi lebih maju. Mendukung mimpi menjadi seorang R&D, saya mengikuti berbagai kegiatan untuk meningkatkan kemampuan soft skill maupun hard skill. Beberapa bulan lalu, saya mengikuti program magang dari perusahaan MNC Group yaitu Buddyku sebagai content creator. Menjadi seorang content creator mengajarkan saya nilai hidup. Yaitu tanggung jawab dalam membuat konten yang informatif dan tidak mengandung hoaks serta disiplin dalam menggunakan waktu untuk menghasilkan karya yang bermanfaat. Kemudian, saya juga mengikuti magang project implementation di Shafiec UNU. Peran saya adalah mendampingi UMKM untuk mengelola sosial media. Kemampuan dalam analisis dan inovasi saya diasah disini. Saya harus bisa menciptakan hal-hal yang bisa menciptakan sebuah konten yang menarik dan informatif. Sehingga, pelanggan bisa tertarik untuk mencoba produk UMKM yang saya kelola. Di samping magang, untuk mengasah kemampuan leadership. Saya mengikuti unit kegiatan mahasiswa yaitu Sekolah Ilmiah Mahasiswa sebagai Staff of Human Resources dan Chemical Engineering Club sebagai Head of Human Resources. Peran saya adalah memonitoring kegiatan yang sedang berjalan atau akan berjalan, menjaga kondusivitas organisasi demi kelancaran berjalannya program kerja, dan menjaga solidaritas serta rasa kekeluargaan antar anggota. Melalui UKM tersebut saya bisa belajar nilai-nilai kerja sama, kepedulian, inovatif, tanggung jawab, dan adaptif. Menjadi mahasiswa yang cukup aktif di luar kampus bukan berarti saya mengesampingkan akademik. Selama saya berkuliah di Universitas Sebelas Maret, saya telah menorehkan beberapa prestasi yaitu, menjadi awardee beasiswa unggulan pada tahun 2020, awardee qaraa digital academy 2022 batch 1, menjadi juara 6 lomba full paper Research and Engineering Studies Petro Oxo Nusantara pada tahun 2022, dan baru-baru ini saya mendapatkan kesempatan untuk melakukan 2 penelitian yang diselenggarakan oleh BPDPKS dan Diktiristek Kemdikbud. Selain itu, selama perkuliahan saya sangat aktif dan memperhatikan materi yang disampaikan. Hal itu dibuktikan dengan nilai IPK saya yaitu 3,84 dari skala 4.',	'Saya pernah mengikuti organisasi selama SMA dan kuliah. Saat SMA saya menjadi ketua departemen penelitian dan pengembangan Organisasi pelajar boarding school MAN 1 Surakarta. Peran saya adalah Mengevaluasi acara yang telah dilaksanakan, bertanggung jawab dalam mendata minat dan bakat anggota, dan membuat kuisioner. Kemudian, ketika kuliah saya mengikuti CERC sebagai head of human resources dan SIM sebagai staff of human resources. Selain itu, saya juga mengikuti kegiatan volunteer di Meraki Asa sebagai staff of human resources. Peran saya adalah memantau dan mengawasi kinerja volunteer setiap 2 minggu sekali, menyeleksi essai peserta International Youth Exchange Turkey, dan\r\nmerancang program kegiatan pengembangan diri untuk volunteer\r\n',	1,	1654067937,	NULL,	0),
('SCHLR-KMSJD-1104ba',	'USR-KMSJD-6d2f8',	'Kms Jodie Lazuardi Haickal',	'2000-04-25',	'895609616999',	'Perum Lobam Bestari Blok B.1 No.18 Seri Kuala Lobam, Bintan, Kepulauan Riau, Indonesia',	'Food Science and Technology ',	'Rajamangala University Of Tech',	'3.49',	'4',	'Saya orang Indonesia, saat ini saya adalah mahasiswa internasional yang belajar gelar sarjana di (program beasiswa penuh) di Thailand. Saya sangat memaksimalkan keterampilan linguistik yang saya pelajari secara otodidak dan menjadikan siapa saya saat ini . Ketertarikan saya pada linguistik membawa saya terpilih sebagai Duta Bahasa Nasional 2019. Menjadi panutan bagi pemuda untuk menggunakan bahasa Indonesia, melestarikan bahasa ibu, dan juga menguasai bahasa asing adalah tugas saya sebagai duta bahasa, bahasa adalah pintu menuju banyak peluang dan salah satu cara untuk bertahan dan bersaing di era globalisasi ini. Kekhawatiran saya tentang kualitas pendidikan di masyarakat, khususnya kemampuan linguistik telah meningkat karena efek globalisasi ini sebagian besar akan mempengaruhi generasi muda. Saya mendedikasikan diri saya untuk mengajar bahasa Inggris dan Korea, dan bahasa Thailand untuk pemuda Indonesia, gratis melalui kelas online, disisi lain saya tetap fokus dengan perkuliahan saya, itu tidak akan menjadi alasan untuk menghentikan saya untuk berbagi pengalaman dan pengetahuan saya dengan semua pemuda di Indonesia untuk membantu mereka tumbuh, karena pendidikan adalah untuk semua orang.\r\n       Terlibat aktif dalam berbagai forum pemuda, konferensi, dan proyek di beberapa negara telah mempertajam pikiran saya dan mengajari saya betapa keragaman dapat menyatukan satu dalam masyarakat. Semakin banyak pengalaman yang saya miliki, semakin banyak orang yang saya temui, dan semakin besar keinginan saya untuk memiliki pengalaman baru. Dengan 5 hingga 6 bahasa yang saya mampu, saya menciptakan cara untuk membangun ikatan yang baik dengan memahami orang, belajar sesuatu dari mereka, berbicara dengan mereka dalam bahasa mereka akan membuat mereka merasa lebih bersemangat untuk berbagi.\r\nBeasiswa YBB Foundation membantu talenta muda yang membutuhkan untuk mewujudkan impian mereka. Selain dukungan keuangan, program beasiswa ini memberikan pengembangan profesional yang menarik dan sistem dukungan mentor yang dirancang untuk memberdayakan talenta muda di kawasan ini untuk mengubah hidup mereka dan membuat perbedaan bagi orang-orang di sekitar mereka. Beasiswa ini akan menjadi wadah yang luar biasa bagi anak muda Indonesia, khususnya bagi saya. Saya mengalami berbagai forum dan konferensi pemuda yang diselenggarakan oleh beberapa negara atau universitas. Itu telah mempertajam pikiran saya dan mengajari saya betapa keragaman dapat membangun persatuan. Semakin banyak pengalaman yang saya miliki, semakin banyak orang yang saya temui, dan semakin kuat keinginan saya untuk memiliki pengalaman baru. Melalui 5 sampai 6 bahasa yang saya gunakan, saya menciptakan cara untuk membangun ikatan yang baik dengan memahami orang, belajar sesuatu dari mereka, dan berbicara dengan mereka dalam bahasa mereka untuk membuat mereka merasa lebih bersemangat untuk berbagi cinta untuk berbagi dan bertukar perspektif, namun saya percaya bahwa di masa depan, saya akan bergabung dengan forum dan konferensi lain. Saya membutuhkan mentor untuk mendukung saya dengan wawasan, dan melalui beasiswa ini, saya yakin akan mendapatkan banyak pengetahuan dan hubungan baik dengan semua orang luar biasa yang akan berarti bagi usaha saya di masa depan.\r\n    Oleh karena itu, selain sedikit pengetahuan saya tentang beberapa bahasa Asia seperti bahasa Indonesia, Korea, Jepang, Thailand, dan Melayu, saya juga berbicara bahasa Inggris, Rusia, dan Spanyol. Saya percaya keterampilan komunikasi ini dan beberapa pengalaman yang saya miliki dapat membantu saya dipertimbangkan untuk beasiswa ini dan membantu saya mencapai mimpi saya.',	'Untuk dapat bekerja di FAO (Food Agricultural Organization) organisasi pangan dunia, ini adalah mimpi terbesar saya untuk mencipatakan dunia tanpa kelaparan. Untuk menggapai mimpi tersebut saya berteguh pada beberapa hal ini yaitu gigih, selalu ingin belajar hal baru, konsisten, target oriented, dan perencana. Kelima hal tersebut sedikit menggambarkan tentang diri saya, lahir dan besar dari keluarga yang sederhana mengajarkan saya bahwa untuk mendapatkan dan mencapai sesuatu terkadang tidak hanya dengan sekali coba, beberapa kali harus gagal, beberapa kali harus memulai ulang, beberapa kali harus mengalah dengan keadaan, dan tidak ada yang dapat menjadikan saya menjadi saya yang sekarang tanpa kegigihan. Beberapa kegagalan, beberapa kali haru memulai ulang membentuk saya untuk selalu konsisten, konsisten memperbaiki kesalahan, konsisten untuk terus berusaha, konsisten untuk mencoba hal baru, karena terkadang dalam hidup kita gagal mencapai target, gagal dengan semua rencana dan skenario yang telah kita rancang, untuk itu perlu adanya kemauan untuk belajar mencoba hal baru, menciptakan kesempatan baru, menentukan target baru dan mempersiapkan rencana lain apabila rencana awal gagal. Dengan beberapa hal tersebut, perlahan saya dapat menciptakan kesempatan yang belum pernah saya pikirkan sebelumnya, karena bagi saya usaha akan perlahan membawakan hasil.\r\n\r\n',	'Kepemimpinan bukan hanya tentang memberi tahu orang lain apa yang harus dilakukan, bagi saya ini adalah tentang bagaimana Anda dapat menjadi panutan bagi anggota anda dan menginspirasi mereka untuk melakukan apa yang menjadi tujuan organisasi anda, dan kemudian melangkah untuk melakukan aksi. Jenis kepemimpinan ini membawa saya menjadi direktur kampus terbaik Thailand dari program dalam kampus Hult Prize Foundation 2020-2021, mewakili universitas saya.\r\nPandemi COVID-19 melanda jumlah orang yang terkena dampak tertinggi di pertengahan tahun 2020 ketika saya memulai kepemimpinan saya sebagai direktur kampus. Semuanya memburuk dari hari ke hari dan mengubah aktivitas apa pun menjadi aktivitas daring, termasuk bagaimana saya harus mengelola tim saya di kedepanya. Saya bertanya pada diri sendiri dan sedikit ragu apakah saya bisa memimpin organisasi besar ini dan menjadi pemimpin yang baik untuk tim saya karena menjadi pemimpin dengan budaya, kebangsaan, dan bahasa yang jauh berbeda dari anggota saya, terus membayangi pikiran saya.\r\n          Saya menghabiskan 2 jam belajar lebih banyak tentang bahasa Thailand setiap hari karena saya satu-satunya orang Indonesia di antara sesama anggota Thailand saya. Alih-alih memaksa mereka untuk berbicara bahasa Inggris, dengan beberapa kendala mereka harus berkomunikasi dengan saya, saya teringat kutipan dari salah satu pemimpin dunia Pak Nelson Mandela, \"jika Anda berbicara dengan seorang pria dalam bahasa yang dia mengerti, itu masuk ke kepalanya.  Jika Anda berbicara dengannya dalam bahasanya, itu masuk ke hatinya\". Dari kutipan itu, saya mulai membangun pemahaman yang baik dengan anggota saya. Semakin hari, semakin kuat pemahaman yang kami buat, pertemuan daring untuk membahas proyek menjadi hari yang paling ditunggu-tunggu agar kami bisa bertemu dan berbagi kebahagiaan, meski hanya lewat pertemuan daring.\r\n           Saya juga merasa senang bekerja dengan anggota tim lainnya karena saya senang mendengarkan ide-ide mereka dalam diskusi kami dan kata-kata baru dalam bahasa Thailand yang tampaknya sangat menantang bagi saya. Saya sangat bersyukur bisa menjadi pemimpin yang dapat mengadakan kompetisi bisnis regional universitas secara daring, bekerja secara profesional dengan tim saya, meskipun kami terpaut jarak tinggal yang sangat jauh.\r\n         Selama kepemimpinan saya, saya belajar bahwa mencapai visi dan misi organisasi adalah hal penting, namun komunikasi dan pemahaman yang baik dengan rekan tim anda akan membawa anda untuk mencapai lebih dari apa yang anda impikan.\r\n',	1,	1655718590,	NULL,	0),
('SCHLR-KNFZY-fd6692',	'USR-KNFZY-c1c28',	'Koni\' Fauziyah',	'2003-02-25',	'85790836312',	'Jln. Gubeng Airlangga V No. 38 B',	'Prodi Ekonomi Islam Fakultas E',	'Universitas Airlangga ',	'3.55',	'2',	'Saya merupakan mahasiswi aktif program studi Ekonomi Islam Fakultas Ekonomi dan Bisnis Universitas Airlangga. Saya memiliki minat yang dalam  dibidang edukasi dan riset ilmiah. Saya adalah orang yang fokus terhadap masa depan, senang merencanakan suatu hal, suka mencoba hal baru dan selalu belajar dari pengalaman. Saya senang berinteraksi dengan orang banyak, bertukar ide dan gagasan dengan orang lain membuat saya menemukan insight baru yang memotivasi saya agar terus tumbuh dan berkembang serta memiliki growth mindset. ',	'Sesuai dengan passion saya di bidang edukasi, mimpi terbesar saya adalah menjadi seorang pengajar, guru atau dosen dikemudian hari. Bagi saya berbagi pengetahuan yang kita miliki untuk orang lain adalah suatu hal yang menyenangkan dan bermanfaat. Cara saya mencapai mimpi besar saya adalah dengan mulai sedikit demi sedikit mewujudkan mimpi- mimpi kecil dalam hidup saya. Seperti fokus kuliah, mengejar nilai yang bagus, mengikuti berbagai perlombaan/magang dan menambah relasi melalui berbagai kegiatan. Selain itu saya juga memiliki keinginan yang kuat untuk melanjutkan S2 saya di Turki dengan beasiswa. ',	'Saat masih SMA saya pernah diamanahi sebagai ketua organisasi di asrama sekolah. Saat itu saya bertugas untuk menertibkan dan mengawasi berbagai kegiatan yang dilakukan oleh para penghuni asrama termasuk memberikan hukuman jika terjadi pelanggaran. \r\nDan pada semester dua ini, saya aktif di Organisasi Fakultas yaitu Association of Sharia Economics Studies (AcSES) dimana saya masuk divisi Research and Paper, yaitu divisi yang mewadahi para  mahasiswa Fakultas Ekonomi dan Bisnis khususnya anggota Access yang memiliki minat dalam penulisan ilmiah. ',	1,	1654414373,	NULL,	0),
('SCHLR-KRSNW-7ab085',	'USR-KRSNW-93ecd',	'Krisnawati',	'2000-10-18',	'82257489273',	'Dk. Jurang Banteng RT. 13/RW. 02, Ds. Cileng, Kec. Poncol, Kab. Magetan, Jawa Timur 63362',	'Prodi Ilmu Komunikasi, Fakulta',	'Universitas 17 Agustus 1945 Su',	'3.59',	'1',	'Saya Krisnawati, saya anak kedua dari 2 bersaudara. Dulu saya bersekolah di salah satu SMK di Magetan Jawa Timur dengan jurusan Multimedia. Hal tersebut mendasari alasan saya masuk jurusan Ilmu Komunikasi saat saya kuliah. Saya sangat menyukai teknologi sehingga saya ingin terus belajar teknologi dimana dapat dilihat bahwa setiap saat teknologi selalu mengalami perkembangan. 2 tahun saya menanti untuk dapat berkuliah akan tetapi belum jalannya, hingga di tahun ke-3 saya dapat berkuliah sesuai impian saya. Saya menunda berkuliah dikarenakan orang tua yang tidak mampu untuk membiayai pendidikan saya dan berakhir saya harus bekerja untuk pendidikan saya pribadi. Dengan begitu saya harus pandai mengatur waktu agar dapat menyelesaikan pendidikan dengan hasil yang baik serta menjadi awal yang baik untuk menciptakan generasi emas di masa depan. ',	'Dari banyaknya mimpi yang telah saya rancang ternyata belum satupun yang berhasil saya dapatkan. Akan tetapi tidak begitu mudah untuk saya menyerah sehingga saya tetap berusaha setiap ada kesempatan. \r\n\r\nMimpi terbesar yang masih saya perjuangkan adalah menang dalam perlombaan. Mungkin menurut orang lain perlombaan itu wajar ada yang menang dan kalah. Akan tetapi bagi saya pribadi menang dalam suatu perlombaan itu adalah kebanggaan tersendiri. Diri merasa berguna, diri merasa bangga, dan menang adalah salah satu cara untuk meningkatkan kepercayaan diri. Hingga pada akhirnya saya tetap menjadi orang pecundang karena belum bisa percaya diri akibat tidak pernah merasakan yang namanya kemenangan. \r\n\r\nTidak mudah pula merancang cara untuk mewujudkan mimpi, tapi sampai saat ini saya berusaha dengan cara meningkatkan kualitas diri, mengikuti sebanyak-banyaknya organisasi pemuda agar dapat banyak pengalaman dan relasi sebelum usia semakin menua, melaksanakan tugas dengan performa terbaik yang saya miliki dan belajar menekulo bakat sesuai skill yang saya miliki. ',	'Sewaktu SMK saya termasuk siswi yang aktif di berbagai kegiatan. Hampir setiap hari selalu pulang malam karena saya mengikuti beberapa organisasi yang memang menguras waktu. Beberapa organisasi yang pernah saya ikuti adalah OSIS, Pramuka, PMR, Forpis, Rohis, Kesenian, PIK-R, dan Karang Taruna. Beberapa organisasi tersebut merupakan organisasi dalam sekolah dan organisasi desa. \r\n\r\nPengalaman paling seru yang saya miliki saat mengikuti berbagai organisasi tersebut adalah ketika pendaftaran siswa/siswi baru di SMK, dimana saat pertama kali masuk sekolah pasti ada yang namanya kegiatan MPLS (Masa Pengenalan Lingkungan Sekolah). Nah beberapa minggu sebelum acara MPLS saya selaku ketua dan anggota OSIS lainnya sudah merancang bagaimana kegiatan tersebut akan dilaksanakan. Kemudian satu minggu sebelum MPLS ternyata saya harus mengikuti kegiatan Pramuka di Kabupaten yang dinamakan Kemah Kampung Kelir, di sana saya berkemah selama 4 hari 3 malam. Dimana kegiatannya adalah menciptakan susana kampung yang kami tempati menjadi kampung yang ramah lingkungan dan bernuansa cerah ceria. Jadi kegiatan kami adalah mewarnai tembok di setiap rumah-rumah dengan berbagai kombinasi warna. Kegiatan tersebut tidak hanya dilakukan 1 regu saja akan tetapi dicampur dengan peserta dari sekolah tetangga. Banyak kegiatan yang saya ikuti termasuk lomba cerdas cermat. 4 hari kemudian saatnya kami kembali ke sekolah untuk beristirahat karena kegiatan telah selesai. Namun beristirahat tidak berlaku untuk saya, karena di hari yang sama setelah saya pulang saya harus menuju lokasi kemah pramuka selanjutnya sebagai panitia, yaitu kemah untuk kenaikan pramuka adik-adik kelas 10. Seperti biasa bahwa acara pramuka tidak bisa membiarkan peserta maupun panitianya tidur nyenyak di malam hari, acara terus berlanjut hingga 3 hari kedepan. Di hari terakhir sebelum kegiatan berakhir saya harus kembali menuju ke sekolah karena di hari tersebut kegiatan MPLS akan dilaksanakan. Sebagai ketua OSIS serta ketua kegiatan tidak mungkin bahwa di hari pertama MPLS saya tidak hadir. Mengkoordinir kegiatan dan memastikan semua berjalan lancar selama 4 hari kegiatan MPLS ternyata cukup menguras tenaga. Karena kegiatan yang saya ikuti selama kurang lebih 10 hari ternyata membuahkan hasil. Yaitu saya tumbang dihari terakhir MPLS. Di pagi hari saat saya akan berangkat ke sekolah saya merasa bahwa hari itu saya benar-benar tumbang. \r\n\r\nYang dapat saya rasakan saat itu adalah saya bangga terhadap diri saya sendiri. Saya yang mampu menyelesaikan beberapa kegiatan dalam organisasi yang memang telah menjadi tanggung jawab saya, serta saya yang mampu belajar dengan baik apa itu kerjasama. Disiplin waktu dan bagaimana cara me-manage waktu tersebut ternyata telah saya terapkan sejak lama. Kegiatan-kegiatan sederhana itu pastinya memberikan dampak yang baik bagi kehidupan saya di masa mendatang. Tidak memandang mudah sesuatu yang terlihat mudah dan tidak mudah menyerah untuk sesuatu yang dirasa susah. ',	1,	1653665288,	NULL,	0),
('SCHLR-KRTKD-62d42c',	'USR-KRTKD-8e51d',	'Kartika Dwi Maharani',	'2002-09-14',	'81216905487',	'Jl pemandian 1 no 13 Kediri Jawa timur ',	'Teknik telekomunikasi/teknik e',	'Universitas Telkom ',	'3.02',	'4',	'Saya adalah seorang mahasiswi semester 4 di universitas Telkom.Saya adalah orang yang disiplin akan waktu,bisa bekerja sama dengan tim,dan bertanggung jawab',	'Mimpi terbesar saya yaitu bisa bekerja di perusahaan BUMN,caranya dengan saya mengasah soft skill,hard skill,dan mencari pengalaman sebanyak mungkin .',	'Saat ini saya mengikuti UKM IEEE,dimana UKM ini bergerak di bidang teknologi',	1,	1654350591,	NULL,	0),
