('SCHLR-KRTKN-1650df',	'USR-KRTKN-35632',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655642227,	NULL,	0),
('SCHLR-KRTKN-23670e',	'USR-KRTKN-35632',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655642228,	NULL,	0),
('SCHLR-KRTKN-af70eb',	'USR-KRTKN-6c05f',	'Kartika Indrasari',	'2005-05-04',	'81515549146',	'Jl. Sakura No. 14A, Desa Pesanggrahan, Kecamatan Batu, Kota Batu, Jawa Timur',	'MIPA',	'SMA Negeri 1 Batu',	'3.43',	'1',	'Saya adalah siswa SMA kelas 10 jurusan MIPA, saya memilih jurusan ini karena kurikulumnya sesuai dengan hal yang saya minati, yaitu arsitektur. Saya memiliki hobi mendesain bangunan dan menggambar, mempelajari hal baru dan menonton film. Menurut saya, dengan mendesain bangunan dan menggambar, saya dapat mengekspresikan ide saya melalui visual, selain itu dengan mempelajari hal baru, saya mampu meningkatkan pengetahuan saya, adapun melalui aktivitas menonton film, saya dapat mengeksplorasi budaya dan karakter suatu wilayah melalui media yang menyenangkan. Sewaktu saya SD, saya menjadi lulusan terbaik, dan hal tersebut mendorong saya untuk terus selalu belajar, karena merupakan bagian dari awal perjuangan saya. Saya juga aktif dalam mengikuti lomba, baik lomba keagamaan dan keolahragaan, seperti lomba cerdas cermat tentang pengetahuan agama, qira\'ah, rebana serta pencak silat. Selain lomba, saya juga aktif dalam organisasi kepramukaan dan OSIS. Saya telah mengikuti kepramukaan sejak saya belia hingga ikut serta dalam event kepramukaan JAMBORE NASIONAL yang diselenggarakan oleh pemerintahan pusat.',	'Mimpi terbesar saya adalah menjadi arsitek yang sukses, oleh sebab itu untuk mewujudkan mimpi saya tersebut, sejak TK, saya senang berlatih untuk mendesain bangunan, baik secara manual maupun digital melalui perangkat lunak SketchUp, kemudian setelah saya mengenal media sosial, saya juga mulai mengikuti akun-akun yang membahas dan menyajikan tentang teknik, desain-desain bangunan dan pengetahuan tentang arsitektur. Hingga saat ini saya juga masih berlatih untuk mendesain bangunan dengan SketchUp untuk memperkaya kemampuan saya dalam mendesain model-model bangunan. Selain itu, saya juga berusaha untuk mewujudkan hal tersebut melalui kegiatan akademik, yaitu dengan masuk pada jurusan MIPA, karena jurusan ini menyajikan mata pelajaran yang mendukung saya agar memahami dasar-dasar arsitektur, yaitu matematika dan fisika. ',	'Iya, saya mempunyai pengalaman organisasi, yaitu pramuka dan Organisasi Siswa Intra Sekolah (OSIS). Pada pramuka, saya aktif mengikuti perlombaan dan berhasil menjuarai perlombaan tersebut, melalui organisasi ini saya juga berhasil mengikuti Jambore Nasional (JAMNAS) yang berkerja sama dengan pemerintah pusat. Melalui kegiatan jambore nasional tersebut saya mendapat kesempatan untuk menambah teman dari berbagai daerah dan provinsi di Indonesia, bahkan ada yang berasal dari mancanegara, seperti Malaysia dan Thailand; mengenalkan budaya lokal kota dan provinsi saya; mencoba kuliner tradisional Indonesia, bertemu dengan orang-orang hebat, seperti pejabat, menteri, aktivis dan presiden. Kegiatan pramuka juga mampu meningkatkan kemampuan saya dalam hal kepemimpinan, patriotisme, nasionalisme, disiplin, survive dan bekerja sama. Adapun dengan mengikuti OSIS, saya berpengalaman dalam merencanakan dan memanajemen suatu acara serta mengkoordinasi kebersihan dan ketertiban siswa. Kemampuan yang saya peroleh dari kegiatan OSIS yaitu peningkatan kemampuan dalam bermusyawarah, manajemen project dan organisasi, berkomunikasi dan manajemen konflik. ',	1,	1655647624,	NULL,	0),
('SCHLR-KRTKS-2251d2',	'USR-KRTKS-91d7a',	'Kartika Ashma Muna Ulwan',	'2003-10-17',	'81381027973',	'PERUM BCK BLOK B.12 NO.11, CIBEBER, CILEGON, BANTEN.',	'MIPA',	'SMA NEGERI 1 KOTA CILEGON',	'3.35',	'0',	'Saya biasa dipanggil Kartika. Saya baru saja menyelesaikan pendidikan saya di SMA. Saat ini saya sudah diterima di Institut Teknologi Sepuluh Nopember jurusan biologi melalui jalur SNMPTN. Saya suka menulis. Belakangan ini saya suka menulis cerpen. Saya juga terbiasa berbicara di depan umum karena saya aktif berorganisasi dari SMP hingga SMA. Saya tidak suka semua sesuatu yang berlarut-larut dan berantakan. Saya memiliki sifat yang labil. Namun, saya berusaha untuk menghilangkan sifat itu dengan membuat kelebihan kekurangan dari hal yang akan saya putuskan. Saya berasal dari keluarga yang sangat sederhana. Dengan kondisi keluarga saya yang seperti ini justru membuat saya lebih semangat untuk menggapai mimpi-mimpi saya.',	'Saya ingin sekali menjadi seorang food scientist dan juga bisa belajar menjadi food scientist di Korea. Cara saya mewujudkannya salah satunya dengan mengambil jurusan biologi ini. Saya juga akan belajar lebih dalam lagi tentang menjadi seorang food scientist dengan cara membaca buku, mencari informasi terkait dari berbagai sumber di internet, maupun mengikuti pelatihan. Selain itu, saya juga akan mencoba untuk mendaftar beasiswa ke Korea.',	'Ya, saya punya pengalaman berorganisasi. Saya mulai berorganisasi semenjak SMP. Saat SMP saya menjabat sebagai ketua OSIS. Banyak sekali pengalaman yang saya dapatkan. Mulai dari mewujudkan suatu event, menyatukan pikiran teman-teman, berbicara di depan umum, berpikir kritis, siap dikritik, belajar lebih untuk bertanggung jawab, dan masih banyak lagi. Saat SMA, saya juga memutuskan untuk bergabung di OSIS lagi karena saya sangat menikmati ketika saya berorganisasi dan saya merasa banyak sekali manfaat yang saya dapatkan. Saya menjabat sebagai Wakil Ketua OSIS saat di SMA. Berorganisasi di SMA harus serba mandiri dan semuanya lebih terorganisir. Ternyata pengalaman dasar berorganisasi saat SMP sangat membantu saya dalam berorganisasi di SMA. Walaupun lelah, tapi keseruannya lebih besar menurut saya. Dengan berorganisasi membuat pikiran saya lebih kompleks dan ternyata ada banyak hal yang kalau dilakukan bersama akan lebih besar dampaknya.',	1,	1655436426,	NULL,	0),
('SCHLR-KSYKF-7322fc',	'USR-KSYKF-1f47d',	'Kaisya Kaifatunajia',	'2005-01-29',	'87710189695',	'Triraksa village 2',	'Mipa ',	'Sman 1 kabupaten tangerang ',	'3.98',	'1',	'Saya seorang siswi yg berasal dari keluarga kurang mampu, yang sedang mencari beasiswa apapun itu ',	'Mimpi saya ingin menjadi menteri keuangan maupun menjadi pemimpin yang jujur.\r\n\r\nCara saya mewujudkannya dengan belajar giat dan tetap fokus dengan tujuan...\r\n\r\nBerpegang teguh dengan prinsip',	'Saya pernah menjadi relawan saat ada bencana banjir ',	1,	1654445345,	NULL,	0),
('SCHLR-KSYNG-92cbca',	'USR-KSYNG-72fab',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655656583,	NULL,	0),
('SCHLR-KTSLV-1c9074',	'USR-KTSLV-9dc83',	'Okta Selvina',	'2002-10-10',	'82186656976',	'Lebuh dalem, Menggala Timur, Tulang Bawang, Lampung.',	'IPS/PENDIDIKAN EKONOMI/FKIP',	'UNIVERSITAS LAMPUNG',	'3.83',	'2',	'saya orang yang sangat fleksibel disemua keadaan dan situasi. saya orang yang semangat untuk meraih cita-cita saya, walaupun dengan keadaan ekonomi yang tidak memungkinkan. tapi saya bersungguh-sungguh ingin menjadi orang yang sukses dan berkecukupan.',	'mimpi saya adalah menjadi orang yang dermawan dan bahagia dengan kehidupan saya sendiri, tanpa merasa iri dengan kehidupan orang lain. cara saya mewujudkan mimpi tersebut dengan bersungguh-sungguh dalam mengerjakan apa yang saya kerjakan ',	'saya baru pertama kali mengikuti organisasi, yaitu pada saat saya berkuliah saat ini. ini hal pertama dalam hidup saya bisa berkontribusi dengan banyak orang untuk memajukan organisasi saya',	1,	1654831682,	NULL,	0),
('SCHLR-KWHYN-37caeb',	'USR-KWHYN-68e19',	'Eka Wahyuni Sari',	'2001-07-14',	'8819018949',	'Cempaka Sari III/17',	'Fisika/FMIPA',	'Universitas Negeri Semarang',	'3.27',	'4',	'Saya pribadi yang cinta banget sama ketenangan dan tidak suka yang bertele-tele (to the point).',	'Impian terbesar Saya yaitu Saya bisa mewujudkan harapan besar orang tua untuk menjadi orang yang sukses. Dan cara Saya menyikapinya yaitu dengan Saya menambah banyak pengalaman seperti aktif organisasi, mengatur waktu dan mencari-cari info kerja part-time agar bisa menambah skill di dunia pekerjaan.',	'Ya, Saya aktif organisasi seperti Saya pernah menjadi panitia Pekan Ilmiah Fisika XXXII pada tahun 2021. Dan pada tahun 2022 ini juga Saya aktif di dua organisasi seperti Keilmiahan Fisika UNNES (Kosmik UNNES) dan Organisasi Daerah (Orda) Jatim.',	1,	1653535634,	NULL,	0),
('SCHLR-LBRDW-3d3108',	'USR-LBRDW-921f5',	'LABORA DWI PUTRI SINAGA',	'2002-10-29',	'81993931426',	'Jl. Pdt. J. Wismar Saragih. Gg  gong 2000, Siantar Martoba',	'Akuntansi',	'Universitas Airlangga',	'3.73',	'4',	'Nama saya Labora Dwi Putri Sinaga, mahasiswa semester empat jurusan akuntansi di Universitas Airlangga. Dengan latar belakang pendidikan saya, saya ingin mendirikan sebuah lembaga sosial yang mengajarkan masyarakat untuk lebih melek finansial. Saya ingin berkontribusi mengembangkan teknologi di bidang bisnis dengan mendirikan startup yang terkait dengan digitalisasi bisnis yang fokus pada bagaimana meningkatkan teknologi yang digunakan dalam bisnis. Tak hanya itu, saya juga ingin mengabdi pada lingkungan sosial dan ekonomi, khususnya bagi UMKM. Dengan melakukan itu, saya berharap orang-orang yang terlibat dalam UMKM mahir dalam bisnis, ekonomi, dan melek teknologi. Dengan demikian, secara tidak langsung dapat meningkatkan taraf hidup dan perekonomian di Indonesia. \r\nDi waktu luang, saya suka melakukan hal-hal yang dapat meningkatkan keterampilan sekaligus menerapkan ilmu pengetahuan saya terhadap lingkungan sekitar, seperti bergabung dalam organisasi atau komunitas sosial untuk melakukan pengabdian masyarakat, menjadi pembawa acara atau moderator dalam webinar yang bermanfaat, dan menjadi tutor untuk teman-teman saya di kampus. Bagi seorang ekstrovert seperti saya, bertemu dan berinteraksi dengan banyak orang baru adalah sebuah kebahagiaan yang dapat memberi saya semangat, energi, dan dorongan untuk terus berkontribusi dalam setiap kegiatan.\r\nAktif dalam berbagai kegiatan baik akademik maupun non-akademik selama kuliah mengharuskan saya untuk memiliki kemampuan komunikasi yang baik, kerja sama tim yang baik, keterampilan dan kreativitas yang unik, kemampuan bekerja di bawah tekanan, kemampuan mencapai target, disiplin, menginspeksi (teliti), dan kepemimpinan yang kuat. Seperti ketika saya menjadi pemimpin proyek pengabdian kepada masyarakat yang mengharuskan saya untuk dapat memimpin, membuat struktur organisasi dan pembagian tugas yang jelas, membuat jadwal rapat, menyiapkan akses dan kebutuhan tim, memastikan kegiatan dilaksanakan dengan baik, mengambil keputusan dengan benar, melakukan evaluasi rutin serta bertanggung jawab penuh atas seluruh kegiatan.\r\nSaya adalah seorang yang perfeksionis, sehingga dalam setiap kegiatan yang saya pimpin, saya selalu optimis dan berhasil melaksanakan rangkaian kegiatan dengan sempurna sesuai dengan rencana. Saya tidak membiarkan suatu pekerjaan diselesaikan karena terburu-buru, bagi saya memberikan hasil yang terbaik adalah wajib. Oleh karena itu, saya selalu melakukan persiapan yang matang sebelum terjun dalam sebuah kegiatan.\r\nPencapaian terbesar saya adalah ketika saya lulus pada UTBK-SBMPTN (Ujian Tertulis Berbasis Komputer- Seleksi Bersama Masuk Perguruan Tinggi Negeri) dan berhasil menjadi mahasiswa Akuntansi Universitas Airlangga. Segala bentuk usaha telah saya lakukan, seperti mengikuti les tambahan, mengikuti kelompok belajar di sekolah, mengukur kemampuan dengan mengikuti berbagai try out, serta mengikuti berbagai seminar motivasi dan kiat sukses lulus UTBK. Selain itu, pencapaian yang saya peroleh yaitu dalam bidang prestasi akademik yaitu: (2022) Awardee Kinobi Asia Scholarship; (2021) Third Winner, Viewspro National Essay Competition; (2021) Top 10, Pandu Beasiswa National Essay Competition; (2021) First Winner, HMA Freshman Championship; (2021) Semifinalis, Sebelas Maret Business Plan Competition; (2021) The Most Contributive Student; (2020) Second Winner, North Sumatera TPA Olympics by Adzkia Learning Center; (2020) Selected Author, National Pentigraf Competition by Jendela Sastra Indonesia; (2021) Top 5, National Opinion Competition.\r\n',	'Saya sangat tertarik dengan penelitian dan pengembangan dalam sektor teknologi ekonomi bisnis. Saya yakin teknologi akan berperan penting dalam perkembangan ekonomi bisnis dalam menciptakan tatanan sistem perekonomian dan bisnis yang aman.\r\nSetelah lulus, saya ingin berkontribusi untuk mengembangkan teknologi dalam bidang ekonomi bisnis dengan mendirikan sebuah perusahaan startup terkait ekonomi bisnis dan sosial berbasis teknologi untuk para pelaku UMKM, sehingga para pelaku UMKM cakap dalam ekonomi bisnis dan melek teknologi. Dengan demikian, secara tidak langsung dapat meningkatkan taraf hidup dan perekonomian di Indonesia.\r\nBerada di fakultas ekonomi dan bisnis memberikan saya keyakinan untuk aktif berkontribusi dan memberikan dampak positif kepada negara dan masyarakat sekitar. Saya menyadari bahwa Akuntansi berperan penting terhadap keberlangsungan dan kestabilan ekonomi suatu negara. Melalui akuntansi, saya dapat mendalami profesi auditor. Audit sangat berguna untuk menambah integritas objek audit seperti laporan keuangan yang bisa dipercaya untuk kepentingan pihak luar seperti pemegang saham, kreditor, pemerintah, dan lain-lain. Selain itu, audit bisa mencegah fraud yang dilakukan oleh manajemen perusahaan. Tidak hanya itu, melalui ilmu akuntansi saya akan mampu menjadi seorang pengamat ekonomi yang memberikan informasi seputar perkembangan ekonomi dan keuangan yang relevan, aktual, dan faktual untuk kepentingan sebuah bisnis industri maupun UMKM di Indonesia. Selanjutnya, melalui ilmu akuntansi saya akan membawa masyarakat kecil dan anak muda di daerah terbelakang untuk melek finansial melalui kegiatan pengabdian masyarakat, workshop, serta literasi keuangan yang dimulai dari hal kecil seperti manajemen keuangan pribadi, manajemen keuangan keluarga, hingga investasi untuk masa depan.\r\nDengan demikian, melalui  pendidikan yang sedang saya tempuh, saya yakin dapat memberikan dampak positif dengan kemampuan melakukan audit melalui profesi auditor sehingga mengurangi tindakan fraud seperti korupsi yang sangat merugikan, membawa masyarakat untuk berpikir modern terkait keuangan serta menyajikan informasi ekonomi bisnis yang relevan, aktual, dan faktual terkait pengambilan keputusan untuk bisnis demi mendukung pertumbuhan ekonomi negara.',	'Sejak SMA saya aktif terlibat dalam beberapa organisasi dan kegiatan sosial seperti dalam organisasi Pasukan Pengibar Bendera Pusaka (Paskibraka). Selain belajar baris-berbaris dan pengibaran Sang Merah Putih pada setiap upacara, saya semakin mengerti arti Nasionalisme dan belajar untuk lebih mencintai Indonesia. Saya diajarkan untuk selalu disiplin, menghargai waktu dan proses serta pola hidup yang sehat dengan makan dan olahraga teratur. Adanya senioritas dalam Paskibra juga mengajarkan saya untuk dapat menghargai orang-orang yang lebih dewasa daripada saya sehingga mampu mengikis egoisme dalam diri saya. Tak hanya itu, saya juga belajar ilmu kepemimpinan dan pelatihan untuk menjadi seorang pemimpin yang kuat secara fisik maupun psikis, tegas, pemberani, disiplin, bertanggung jawab dan peduli terhadap anggota tim. Saya juga dituntut untuk mampu beradaptasi dan memahami berbagai karakteristik manusia. Saya juga dihadapkan dengan beberapa permasalahan yang menuntut saya untuk belajar memecahkan masalah dan mengambil keputusan dengan tepat dan cepat. Saya juga menjadi terbiasa dalam kerja sama tim dan berpikir secara rasional dengan tidak merugikan pihak manapun dalam pengambilan keputusan sebab dalam Paskibra ada istilah \"satu untuk semua dan semua untuk satu\".\r\nDalam organisasi PERSISTEN (Persekutuan Siswa Kristen) Pematangsiantar, saya belajar bersosial dan bermasyarakat. Saya belajar untuk saling menghargai, selalu menjaga sopan dan santun serta selalu bersikap sesuai ajaran agama, dimana semua agama selalu mengajarkan untuk berbuat baik tanpa pamrih kepada siapapun. Melalui organisasi ini saya belajar banyak tentang ilmu agama dan penerapannya dalam kehidupan saya sehari-hari sebagai seorang pelajar, anak, dan warga negara. Saya juga kerap kali ditunjuk sebagai ketua pelaksana dalam berbagai kegiatan sosial yang dilaksanakan oleh organisasi PERSISTEN yang membuat saya belajar memimpin secara kreatif dan inovatif, memecahkan masalah dan mengambil keputusan dengan tepat dan cepat serta memupuk jiwa sosial saya. Selain itu, organisasi ini juga mengajarkan saya cara menghargai setiap kesempatan dan kehidupan yang diberikan oleh Tuhan Yang Maha Esa sehingga membentuk saya menjadi seorang pekerja keras yang cerdas dalam menggunakan waktu dan kesempatan yang ada secara maksimal sehingga menjadi seorang yang perfeksionis yang berpegang teguh pada proses dan hasil. Pada tahun 2019 saya pernah menjadi ketua pelaksana pada kegiatan KATA PERSISTEN (Kebaktian Awal Tahun) 2019. Kegiatan ini merupakan sebuah acara penyambutan siswa-siswi baru SMA/K Kristen dan Katolik di kota Pematangsiantar yang mengundang sekitar 1000 siswa-siswi baru selama 1 hari dengan persiapan kepanitiaan selama 2 bulan  dengan berbagai rangkaian kegiatan yang bertujuan untuk memperkenalkan kehidupan SMA/K dan mengajarkan para murid baru untuk tetap teguh dalam berkeyakinan beragama.\r\nSejak saya bergabung dalam organisasi Himpunan Mahasiswa Akuntansi PSDKU Universitas Airlangga saya belajar banyak hal baru yang membuat saya menjadi lebih dewasa dalam berpikir dan berperilaku. Di organisasi ini saya benar-benar diperhadapkan dengan konflik yang cukup berat dan menuntut saya untuk mampu berpikir kritis dalam memecahkan masalah. Saya belajar untuk selalu sabar dan kuat dalam menghadapi segala situasi yang terkadang tidak sesuai dengan rencana. Kerap ditunjuk menjadi ketua pelaksana kegiatan, membentuk saya menjadi pribadi yang tegas, disiplin, berani, tanggap, memiliki kemampuan public speaking yang baik serta cara berorganisasi yang benar. Selain itu saya juga harus mampu memanajemen waktu dengan baik, sehingga dapat membagi waktu antara kegiatan belajar dan berorganisasi. Melalui organisasi ini saya juga belajar untuk menghadapi sebuah instansi dan belajar bagaimana cara melaksanakan sebuah kegiatan besar seperti webinar nasional, pengabdian masyarakat, dan sebagainya.\r\nPada tahun 2020 saya pernah menjadi ketua pelaksana pada kegiatan Pengabdian Masyarakat Mahasiswa Baru S1 Akuntansi 2020 PSDKU Universitas Airlangga. Kegiatan ini berupa pengabdian masyarakat berbentuk seminar online nasional dengan tema Digital Marketing dan terbuka untuk umum. Kegiatan ini berhasil mencapai total peserta sekitar 300 orang dan mengundang 3 orang pengusaha muda berbakat sebagai pembicaranya. Kegiatan ini bertujuan untuk memberikan pemahaman dan pengajaran kepada masyarakat tentang manfaat, cara, dan tips berbisnis menggunakan Digital Marketing.\r\nPada tahun 2020 saya pernah menjadi ketua pelaksana atau ketua Komisi Pemilihan Umum kegiatan PEMIRA (Pemilihan Raya) Ketua Himpunan Mahasiswa Akuntansi PSDKU Universitas Airlangga. Dimana kegiatan ini menghasilkan output terpilihnya ketua himpunan periode baru.\r\nPada tahun 2020 saya pernah menjadi ketua tim PKM-K (Pekan Kreativitas Mahasiswa- Kewirausahaan) dan berhasil membawa tim saya lulus seleksi Universitas serta menjadi salah satu perwakilan yang dikirimkan ke RISTEKDIKTI untuk mendapatkan realisasi pendanaan.\r\nSelanjutnya pada tahun 2021, saya ditunjuk menjadi Koordinator Lapangan pada kegiatan pengenalan mahasiswa baru (Ospek) untuk tingkat fakultas. Sebagai seorang koordinator lapangan, saya bertugas mengelola berbagai hal seperti memfasilitasi kegiatan, membantu ketua dalam pelaksanaan tugasnya, memimpin setiap rapat dan forum panitia, dan bertanggung jawab atas perizinan. Dalam kegiatan ini, saya bertugas mengawasi 8 tim dan setiap tim terdiri dari 4-6 orang.\r\nSelain itu, saya juga sering menjadi moderator dan Master of ceremony dalam berbagai acara webinar/workshop/talkshow yang diadakan oleh kampus. Melalui ini, saya banyak belajar tentang public speaking dan cara merencanakan, melaksanakan, dan mengevaluasi sebuah kegiatan.',	1,	1655740790,	NULL,	0),
('SCHLR-LBWTP-1c2561',	'USR-LBWTP-2c129',	'Elbi wita puspita',	'2002-07-16',	'85378906593',	'bekasi, jawa barat',	'sastra inggris',	'universitas gunadarma',	'3.80',	'2',	'saya merupakan orang yang energic, selalu penasaran dan mau belajar tentang hal baru, tidak mudah menyerah, gigih dan selalu peduli dengan isu-isu yang terjadi di masyarakat. ',	'impian terbesarku adalah ingin menjadi seorang diplomat ataupun seorang forensik linguistik. cara saya mewujudkannya adalah dengan mengambil jurusan kuliah dengan basic dalam bidang tersebut serta banyak belajar dan melakukan berbagai kegiatan sebagai pengalaman saya.',	'tentu saja. saat berada di SMA saya aktif mengikuti berbagai organisasi seperti OSIS, PMR dan English club.selain itu saya juga aktif mengikuti berbagai lomba yang ada disekolah maupun luar sekolah. tidak hanya saat SMA saja, sekarang saya sebagai mahasiswa juga mengikuti organisasi yaitu HIMASI (himpunan mahasiswa sastra inggris). Saya aktif dalam kegiatan tersebut dan juga berniat untuk bergabung dalam berbagai kegiatan organisasi atau relawan yang ada di kampus. ',	1,	1654517953,	NULL,	0),
('SCHLR-LCKYR-62cbea',	'USR-LCKYR-68eb9',	'Lucky Rezkita Larasati',	'2002-08-29',	'85162809514',	'Gang Mawar VII RT03/02, Padurenan, Mustika Jaya, Kota Bekasi, Jawa Barat. ',	'Gizi',	'Universitas Negeri Semarang',	'3.78',	'4',	'Saya adalah seorang mahasiswi yang berasal dari jurusan gizi, saya adalah orang yang mandiri, tekun, ambisius, suka mencoba hal baru, suka menganalisis dan dapat berpikir kritis.  Saya adalah seorang yang ekstrovert dan bisa bekerja sama dengan orang lain dengan cukup baik. Kekurangan dalam diri saya yaitu kurang teliti dalam mengerjakan sesuatu karena saya cenderung mengerjakan secara cepat, tetapi ini bisa disiasati dengan pemeriksaan ulang pekerjaan yang sudah saya selesaikan.',	'Mimpi terbesar saya adalah bermanfaat bagi orang lain dan menuntaskan segala permasalahan gizi di Indonesia, cara saya mewujudkannya yaitu dengan terus belajar secara akademik dan mengaplikasikannya langsung ke lapangan, saya sudah mulai mewujudkannya dengan menjadi relawan atau menjadi edukator kepada teman teman dan masyarakat yang berada di lingkungan saya, saya merasa bahagia ketika orang lain antusias dan merasa terbantu oleh ilmu yang saya dapatkan baik dari perkuliahan maupun dari luar. ',	'Iya, saya mengikuti organisasi Himpunan Mahasiswa Gizi dan menjadi ketua divisi bakat dan minat, saya bertugas untuk mendata bakat minat mahasiswa prodi gizi dan menyalurkan bakat minat mereka, misalnya mendaftarkan/memberi informasi mengenai suatu lomba. Saya juga seringkali dipilih menjadi seksi acara dalam kegiatan HIMA, saya bertugas sebagai pengatur acara agar berjalan dengan baik, saya  cukup belajar banyak bekerjasama dalam organiasi ini. Saya saat ini sedang menjadi relawan dari Generasi Bebas Stunting (GBS) batch 4, itu merupakan program untuk membantu menurunkan prevalensi stunting di Indonesia. Disana kami melakukan survey posyandu diarea tempat tinggal dan memberikan edukasi terkait stunting, saya belajar banyak dari kegiatan turun ke lapangan tersebut karena bisa bertemu dan berbicara langsung dengan kader/petugas posyandu serta ibu dan anak, saya juga melakukan sharing ilmu kepada kader yang lebih berpengalaman. ',	1,	1655091815,	NULL,	0),
('SCHLR-LDGHF-4d0e47',	'USR-LDGHF-b82bc',	'Aldi Ghofari',	'2004-12-11',	'85746156500',	'Desa kwagean legok, rt06/ rw03, kecamatan Wonopringgo, kabupaten Pekalongan, Jawa Tengah',	'MIPA',	'SMA NEGERI 1 KEDUNGWUNI',	'0.00',	'4',	'Nama saya Aldi Ghofari, umur 17 tahun, saya berdomisili di Pekalongan dan saat ini saya bersekolah di SMA NEGERI 1 KEDUNGWUNI kelas 11 peminatan MIPA. Saya suka dengan mata pelajaran matematika dan saya terpilih dan tergabung dalam perwakilan sekolah saya dalam mengikuti lomba KSN-k tahun ini. Saya juga suka membantu orang tua saya mengelola usaha kecil-kecilan di rumah. Hal ini yang memberi ketertarikan saya untuk memilih prodi bisnis dan administrasi sebagai jurusan kuliah saya. Kelebihan saya adalah cepat beradaptasi, terstruktur, kreatif, penuh semangat tinggi, serta dapat bekerja dengan tim. Kekurangan saya adalah Belum Memiliki Pengalaman yang Banyak, \r\nTidak Sabaran, \r\nKurang Percaya Diri, \r\nKurang Menguasai Bahasa Asing.',	'3 mimpi terbesar dalam hidup saya :\r\n•Bahagia dunia akhirat.\r\n•Membahagiakan orang tua. \r\n•Memiliki pekerjaan yang baik. \r\nCara untuk mewujudkannya:\r\n1. Menentukan Tujuan dan Catat Perencanaan.\r\n2. Percaya dengan Kemampuan Diri.\r\n3. Selalu Haus akan Ilmu dan Pengalaman. \r\n4.Melakukan Networking. \r\n5.Berpikir Positif.\r\n6. Mencari lingkungan yang mendukung. \r\n7. Menyertakan doa dalam setiap usaha.',	'Selama di sma saya aktif dalam organisasi pramuka dan karya ilmiah remaja (KIR), saya juga berkontribusi dalam organisasi osis sewaktu di smp.\r\nBanyak sekali pengalaman yang saya peroleh dari kegiatan Pramuka. Mulai dari SD sampai SMA, ada saja yang berkesan.\r\n\r\nIntinya apa saja yang susah, senang, gembira, dan sedih bisa dirasakan bersama. Mulai dari dinamika kelompok hingga ketrampilan diri pun diuji.\r\nadalah melakukan penelitian ilmiah, melakukan percobaan atau eksperimen yang berhubungan dengan SAINS, hal yang paling menguntungkan mengikuti organisasi ini adalah ketika mendapat tugas yang berhubungan dengan pelajaran MIPA, senior KIR rela menggunakan waktunya untuk mengajari saya mengerjakan tugas tersebut. Pada saat penerimaan murid baru, saya dan rekan saya melakukan sebuah percobaan ilmiah menggunakan senyawa-senyawa kimia untuk demonstrasi memperkenalkan ekskul KIR kepada murid baru. Ketika saya menjadi senior, saya melantik adik kelas saya yang juga ikut dalam ekskul ini. Itulah pengalaman saya selama mengikuti beberapa organisasi di sekolah. Banyak sekali keuntungan yang dapat kita ambil jika mengikuti berbagai organisasi, seperti bertambahnya koneksi dalam kehidupan social sehingga dapat memperluas hubungan serta menambah wawasan dari organisasi yang kita ikuti tersebut.',	1,	1655396887,	NULL,	0),
('SCHLR-LDHRL-39d0cc',	'USR-LDHRL-6db8c',	'Aldhira Latifa Zalianti',	'2003-04-21',	'83101478293',	'Kp. Manapa Rt/Rw 01/04, Des. Karangtanjung, Kec. Cililin, Kab. Bandung Barat',	'Sejarah dan Peradaban Islam/Ad',	'UIN Sunan Gunung Djati Bandung',	'4.00',	'2',	'Saya adalah orang yang terkadang menyerah, tetapi memiliki tekad yang kuat karna saya harus mewujudkan mimpi mimpi saya',	'Menjadi seorang guru dan public speaking yang baik',	'Menjadi bagian dari sosial media, menyenangkan dan bisa menambah ilmu, wawasan dan relasi',	1,	1654409074,	NULL,	0),
('SCHLR-LDLVN-a8c01c',	'USR-LDLVN-60d78',	'La Ode Alvin Rahmat Saputra',	'2004-08-29',	'82258297859',	'Jl. Baru Wandoka, Lingk. Wakeleu, Kec. Wangi-wangi, Kab. Wakatobi, Sulawesi tenggara ',	'IPA',	'SMAN 1 WANGI-WANGI',	'3.62',	'6',	'Perkenalkan nama saya La Ode Alvin Rahmat Saputra, usia 18 tahun. Saya baru saja lulus dari SMAN 1 Wangi-wangi dan sedang menunggu pengumuman penerimaan mahasiswa baru di Universitas Haluoleo jurusan Ilmu Komunikasi. \r\nSemasa SMA, saya aktif berkontribusi terhadap sekolah dengan mengikuti beberapa organisasi. Di SMP saya menjabat sebagai ketua OSIS dengan berhasil melaksanakan program program kerja yang telah dirancang dan juga di OSIS SMA, saya menjabat sebagai ketua bidang Teknologi Informasi dan Komunikasi. Hasil dari semua itu, saya bisa memiliki jiwa kepemimpinan yang baik, dan mampu meng-handle orang banyak.',	'Sejak kecil, selalu terbesit di pikiranku tentang apa impian ku di masa depan. Saat itu saya ingin menjadi seorang yang bisa ke luar negeri dan bisa bekerja di kantoran karena melihat tayangan di televisi. Hal itu menjadi motivasi saya selama sekolah. Seiring berjalannya waktu, saya sadar bahwa impian tersebut benar adanya dan semakin tambah besar motivasi ku agar bisa mewujudkan impian tersebut. Bisa belajar di luar negeri dengan beasiswa adalah salah satu impian ku. Untuk mewujudkan impian tersebut tentunya diperlukan usaha yang kuat dan tekad yang besar. \r\n\r\nUsaha yang saya lakukan untuk mewujudkan impian tersebut dengan menyusun rencana dan tujuan yang jelas. Semasa sekolah saya belajar dengan giat sehingga bisa mengikuti berbagai lomba dan kegiatan agar bisa meningkatkan kualitas diri saya. Saat ini saya juga sedang belajar Bahasa Inggris di sebuah les. Kedepannya di perguruan tinggi nanti, saya mendaftar beasiswa ke luar negeri untuk pertukaran pelajar dan untuk S-2. \r\nSelain usaha, juga di barengi dengan doa agar impian saya bisa terwujud',	'Ya, saya pernah bergabung di beberapa organisasi, diantaranya adalah :\r\n1. Ketua Osis SMPN 5 Wangi-wangi\r\nMampu menjadi ketua osis yang baik selama masa jabatan dengan\r\n menginisiasi untuk mengadakan lomba yang mampu memupuk kreativitas siswa dan bekerja sama dengan guru,\r\nyaitu lomba kebersihan kelas serta sering menjadi\r\n komandan barisan untuk mengatur jalannya upacara dan apel pagi.\r\n2. Ketua Sekbid Osis 9 SMA\r\nKetua sekbid Teknologi informasi dan komunikasi SMAN\r\n1 wangi-wangi tahun 2021-2022\r\nBerhasil melaksanakan program kerja dengan baik yaitu mendokumentasikan, mengedit dan\r\nmempublikasikan segala kegiatan osis serta mengelola akun sosial media\r\n sekolah sehingga akun sekolah menjadi aktif.\r\n3. Wakil Ketua Forum Anak Kabupaten Wakatobi\r\nBerkontribusi dalam pengembangan dan pemberdayaan anak di daerah tertinggal sebagai wakil ketua forum anak dengan mengadakan kegiaan yang bekerja sama dengan organisasi dan pemerintah setempat, seperti sosialiasi bahaya Stunting pada anak, lomba 17 Agustusan, serta musrembang bersama pemerintah daerah\r\n4.\r\nPramuka Saka Bhayangkara\r\nSatuan Pramuka saka bhayangkara 2017-2018\r\nMengikuti berbagai kegiatan pramuka, salah satunya mengikuti perkemahan selama tiga hari yang meningkatkan\r\n skill kepemimpinan diri saya.\r\n5. Sail to Nias Indonesia 2019\r\nBerhasil menjadi guide tour atau pemandu wisata bagi turis yang mengikuti kegiatan sail to Indonesia di Wakatobi dengan mempromosikan dan memperkenalkan potensi potensi wisata yang ada di Wakatobi sehingga bisa terkenal di mancanegara.\r\n6. Pik R SMAN 1 Wangi-wangi\r\nBerkontribusi langsung dengan manusia dan alam dan mengikuti berbagai aktivitas PIK R, salah satunya penanaman pohon mangrove di pantai pantai yang ada di Wakatobi \r\n7. Pengamanan lalu lintas menjelang hari raya tahun 2018 bersama Polres Wakatobi\r\nBerhasil membantu anggota kepolisian polres Wakatobi dalam pengamanan lalu lintas menjelang hari raya idul Fitri tahun 2018 sebagai perwakilan dari Pramuka Saka Bhayangkara dengan turun langsung di jalan mengatur lalu lintas sehingga menjadi aman dan tertib. \r\n8. Accounting Future Leaders\r\nSebuah organisasi pemuda nasional yang bergerak dibidang accounting dimana saya bertugas di divisi Design & Socmed dan berhasil mengadakan kegiatan di bidang Start Up bernama Dynamic Leadership Development berskala nasional dengan ratusan peserta dan narasumber ahli di bidangnya.',	1,	1655002323,	NULL,	0),
('SCHLR-LFHRL-5e05a8',	'USR-LFHRL-ac423',	'Alfiah Roua Al-Multazam',	'2001-04-16',	'81382500129',	'JL Kakatua II No 75',	'Ilmu Keperawatan Fakultas ilmu',	'UIN Syarief Hidayatullah Jakar',	'3.60',	'4',	'saya merupakan mahasiswi di fakultas kedokteran dan ilmu kesehatan dengan ip terakhir yang saya dapatkan ialah 3,9, saat ini saya aktif self development baik soft skills seperti critical thingking,problem solving,leadership serta public speaking oleh karena itu saya sering dipercaya menjadi narasumber, public speaker dan master of ceremony di acara besar baik regional maupun nasional selain itu saya mengasah hard skill saya dengan menjadi delegasi indonesia dalam pertukaran pelajar yakni australian student exchange di university technology of sydney juga menjadi delegasi dalam netherland student exchange juga south korean student exchange di ewha university dan menjadi top best score by lionezta educational juga terpilih menjadi duta bangsa dalam program land of leaders di istanbul turkey serta seringkali menjadi delegasi dalam konferensi pbb yakni international model united nations yang mereprentasikan japan dan venezuela serta menjalani internship disana selain internship di rumah sakit umum pusat fatmawati jakarta selatan ',	'mimpi terbesar saya adalah sukses dan bermanfaat bagi orang banyak yang saya aplikasikan dengan terus mengasah kapabilitas dan kredibilitas diri saya dengan banayk mempelajari hal baru melalui student exchange dan menjadi delegasi indonesia di berbagai konferensi international di kancah dunia. ',	'ya saya aktif menjadi ketua organisasi diberbagai bidang dan mendapat beberapa penganugrahan diantaranya ialah top womanpreneur by pertamina foundation, selain itu menjadi ketua empowering woman ruby community entrepreneurship leader team dan ketua perempunesia maju banten dibawah naungan gubernur banten serta aktif dalam organisasi syahid model united nations dan sering menjadi delegasi konferensi di gedung mpr ri juga didatangi oleh komisi 4 dpr dan bapak mentri sandiaga uno serta relawan dalam beberapa pengabdian di daerah daerah terpencil di indonesia. ',	1,	1654412587,	NULL,	0),
('SCHLR-LFMST-fd0cd7',	'USR-LFMST-b71bb',	'Alif Mustafa',	'2001-10-22',	'85647687512',	'Jln. Wijaya Kusuma, Desa Kabunan Rt 05/02, Kecamatan Dukuhwaru, Kabupaten Tegal',	'Prodi Aqidah dan Filsafat Isla',	'Universitas Islam Negeri Salat',	'3.67',	'4',	'Saya adalah anak pertama yang diharapkan oleh orang tua saya menuju kesuksesan, namun terkendala biaya, menurut pendapat orang - orang, saya ketika di dalam organisasi disebut sebagai pemikir yang bisa mengeluarkan ide - ide baru, maka dari itu tidak heran jika teman - teman terkadang menunjuk saya ketika akan mengadakan sebuah program kerja baru. ',	'mimpi terbesar saya adalah menjadi pengusaha sukses dan bisa membanggakan kedua orang tua saya, untuk mewujudkannya saya harus tekun menjalani tugas kewajiban saya dengan sungguh - sungguh agar tercapai segala impian saya. \r\nmotivasi saya mendaftar beasiswa ini karena saya ingin menggapai cita - cita saya dan membanggakan kedua orang tua saya, walaupun saya berasal dari keluarga yang kurang mampu tetapi tidak menyurutkan semangat saya, maka dari itu saya mendaftar beasiswa untuk bisa meringankan beban orang tua saya. saya yakin saya bisa membuktikan bahwa orang yang berasal dari keluarga kurangg mampu pun bisa meraih cita - citanya tanpa membebani kedua orang tua nya.',	'ketika SMA/MAN saya di pilih menjadi ketua umum organisasi ekstrakurikuler Teater Emas, dan di dalam pimpinan saya, berhasil menjuarai beberapa perlombaan berkat kerjasama tim, dari mulai juara 1 hingga juara 3. kemudian, di desa saya sudah 10 tahun berpengalaman di organisasi IPNU, sampai saat ini saya menjabat sebagai wakil ketua umum, hingga saya bisa masuk kepengurusan tingkat kecamatan di PAC IPNU sebagai Departemen Seni Budaya, alasan saya di pilih masuk kedalam departemen seni budaya karena saya dulu pernah menjabat sebagai ketua teater. ',	1,	1655709865,	NULL,	0),
('SCHLR-LFNRF-4ad8e8',	'USR-LFNRF-b4482',	'Alifia Nur Ifany',	'2002-07-18',	'81325881430',	'Jalan Gedongsongo Tengah I No 40 RT 11 RW 01 Kelurahan Manyaran,\r\nKecamatan Semarang Barat, Kota Semarang, Jawa Tengah',	'Psikologi',	'Universitas Sebelas Maret',	'3.67',	'4',	'Saya merupakan orang yang suka mengeksplorasi hal baru. Saya suka belajar hal-hal baru dan memperbaiki diri agar terus menjadi lebih baik. Saya merupakan orang yang suka berkomunikasi dengan orang lain. ',	'Saya ingin menjadi Psikolog yang dapat memberikan pelayanan kesehatan mental terbaik dengan bayaran tidak berupa uang. Cara mewujudkan hal tersebut yaitu saya berkuliah di jurusan Psikologi dan berencana untuk melanjutkan kuliah saya di S2 Magister Profesi Psikolog. Selain itu, saya berencana menjadi dosen psikologi di salah satu universitas negeri di Indonesia sehingga saya tidak bermasalah dengan pemasukan jika saya menjadi psikolog yang menerima bayaran tidak berupa uang.',	'Saya memiliki pengalaman organisasi di Himpunan Mahasiswa Psikologi Universitas Sebelas Maret. Pada tahun 2020-2021, saya menjabat menjadi staf Ketahanan Internal Lembaga. Lalu pada tahun 2021-2022 saya menjabat menjadi staf ahli Ketahanan Internal Lembaga. Ketahanan Internal Lembaga merupakan divisi pada himpunan saya yang membantu mewujudkan organisasi yang memiliki nilai profesionalisme dan kekeluargaan.',	1,	1654239694,	NULL,	0),
('SCHLR-LFPTR-c26c5b',	'USR-LFPTR-0ec97',	'Alifia Putri Aviqah',	'2001-08-01',	'895395153422',	'Griya Kebraon Utara IV, Karangpilang, Surabaya',	'S1-Ekonomi Pembangunan/Fakulta',	'Universitas Airlangga',	'3.47',	'6',	'Nama saya Alifia Putri Aviqah, biasa dipanggil Aviqa. Usia 20 tahun dan berdomisili di Surabaya. Saat ini sebagai mahasiswa S1 Ekonomi Pembangunan dari Fakultas Ekonomi Bisnis Universitas Airlangga. Sejak kecil, saya selalu berusaha aktif dalam kegiatan akademik maupun non-akademik. Di kelas 2 hingga 6 SD, Alhamdulillah saya berhasil mempertahankan sebagai peraih ranking 1 dan lulus sebagai peraih nilai UN & USEK tertinggi. Ketika duduk di bangku SMP & SMA, saya juga seringkali diamanahi untuk menjadi perwakilan sekolah dalam berbagai ajang kompetisi hingga berhasil menjadi peraih Ranking Parallel 1 SMAN 13 Surabaya dan diterima di Unair melalui jalur SNMPTN. Sungguh semua ini tidak lepas dari do\'a & dukungan orang tua serta restu Allah. Saya juga berkesempatan menjadi seleksi terpilih dalam ajang SIS Badminton Tournament. \r\nSaya memiliki ketertarikan dalam bidang bisnis dan juga surat menyurat (kesekretariatan). Bisnis yang pernah saya jalani yaitu alat tulis dan tas wanita. Kemudian ketertarikan dalam bidang surat menyurat menjadikan saya sebagai sekretaris selama SMA dan juga sekretaris guru. Masuk dalam dunia perkuliahan, saya berusaha untuk dapat berkontribusi pada setiap kegiatan kampus yang tentunya dapat melatih softskill. Pada tahun sebelumnya saya diamanahi jabatan sebagai Kepala Biro Kesekretariatan HIMA EP Unair serta Staff Ahli Divisi PSDM UK Mapanza. Selain itu, saya juga berusaha untuk tetap aktif dalam mengikuti kompetisi/perlombaan yang relevan dengan kemampuan diri. Saya merupakan pribadi yang teliti akan suatu pekerjaan, memiliki keinginan yang tinggi untuk mempelajari hal-hal baru, tidak mudah menyerah, mampu berkomunikasi baik dan berperilaku jujur, dan tidak mudah menyepelekan suatu hal. ',	'Dalam hidup ini, mimpi terbesar saya adalah bisa selalu menjadi pribadi yang berbakti bagi orang tua dan selalu berusaha untuk membahagiakannya. Baik dalam hal perilaku, tutur kata, maupun akademik. Karena orang tua adalah sebaik-baiknya pintu surga. Memberangkatkan orang tua ke tanah suci untuk melaksanakan ibadah haji merupakan impian terbesar saya. Sehingga untuk mewujudkannya, saya berusaha selalu fokus dalam mengenyam pendidikan agar nantinya dapat memperoleh pekerjaan yang memadai dan sesuai dengan passion saya. Sehingga dari penghasilan inilah saya bisa mewujudkan impian terbesar saya. Selain itu, impian saya dalam hidup ini adalah selalu dan senantiasa dapat bermanfaat bagi orang lain.',	'Iya, saya mempunyai pengalaman dalam hal organisasi dan juga relawan. Berbekal dari ketertarikan dalam hal surat menyurat dan menulis, serta bekal pengalaman sebagai sekretaris selama SMA, hal inilah yang mengantarkan saya untuk berkontribusi pada organisasi internal kampus yakni HIMA EP UNAIR. Pada himpunan mahasiswa ini saya diamanahi jabatan sebagai Kepala Biro Kesekretariatan. Yang mana tugas saya adalah membuat proposal program kerja, surat internal dan eksternal, lembar pertanggungjawaban (LPJ), melaksanakan birokrasi baik secara online maupun offline, bertindak sebagai notula dalam rapat, pengarsipan dokumen organisasi, serta mengontrol kinerja para staff. Selain itu, saya juga diamanahi sebagai Staff Ahli PSDM UK Mapanza Unair. Yang mana tugas saya adalah menerapkan strategi kaderisasi dalam organisasi, sebagai penanggung jawab Mapanza Prestasi, dan meningkatkan rasa kekeluargaan antar anggota. Selain HIMA EP Unair dan UK Mapanza Unair, saya juga turut berproses dan berkontribusi sebagai Sekretaris I pada Remaja Masjid Sabiilil Hikmah. Yang mana saya bertugas dalam pengarsipan dokumen, sebagai notula (notulensi rapat), dan turut serta dalam perencanaan dan pelaksanaan kegiatan remaja masjid. Dalam hal relawan, saya memiliki pengalaman untuk berkontribusi sebagai Volunteer Bakti Sosial dengan adik-adik panti asuhan dalam kegiatan yang diselenggarakan oleh UK Mapanza. Dalam kegiatan ini, saya juga berusaha menjelaskan kepada adik-adik mengenai bahaya dari pemakaian narkoba. Selain itu, saya juga memiliki pengalaman sebagai Volunteer Sie Region dalam Olimpiade Ekonomi Unair 16th. Yang mana saya membantu kakak panitia dalam mempromosikan event olimpiade ini kepada siswa SMA di Surabaya.',	1,	1655698899,	NULL,	0),
('SCHLR-LFRDL-c79823',	'USR-LFRDL-0d1c1',	'Alfredo Alan Samudra',	'2002-03-14',	'81236267286',	'KP. Blok 1, RT/RW 002/006, No. 484, Desa Simpangan, Kec. Cikarang Utara, Bekasi  17836 ',	'Hukum',	'President University',	'3.90',	'3',	'Menarasikan perihal diri sendiri agaknya terkesan subjektif karena, penutur menempati posisi utama nan dominan dalam penceritaan. Namun, biar bagaimanapun tentang diri sendiri perlu dikisahkan agar sekurang-kurangnya yang lain tahu. Itu saja mungkin. Saya terlahir sebagai anak kedua dari empat bersaudara. Kedua orang tua saya adalah petani. Bisa dibayangkan bagaimana keseharian kami sebagai anak pedesaan di Flores, NTT. Keluar masuk hutan cari kayu bakar, bolak-balik kebun, mondar-mandir di pematang sawah adalah rutinitas khas yang dilakoni selepas mereguk air pengetahuan di sekolah. Polah asuh-didik berimbang yang diterapkan orang tua berorientasi agar saya tepatnya kami sebagai anak: ulet dalam bekerja, gigih dalam berjuang, plus tekun-cermat dalam belajar. Ya, kami sekeluarga memang tak selalu berkecukupan dengan pendapatan orang tua yang tak tentu dan kebutuhan rumah tangga yang jamak. Namun, saya secara personal yakin berkah Tuhan senantiasa lebih besar. Makin ke sini saya menyadari bahwa sikap pantang menyerah, tekun-konsisten, pantang menyerah, doyan baca-tulis, tepa selira, dan sikap welas asih adalah hal-hal yang sangat melekat pada saya. Seabrek karakter atau sikap itu menjadi ciri khas juga dalam taraf tertentu saya memaknainya sebagai kelebihan yang patut disyukuri. Tak sedikit hal-hal getir yang saya alami bisa saya atasi berbekal seperangkat karakter baik itu. Bahwasannya sikap kadang mengeluh, berlaku lamban, dan acapkali menunda pekerjaan adalah karakter-karakter saya yang tak elok. Dan memang tak layak diteladani untuk karakter-karakter yang seperti ini. Saya senantiasa bersyukur atas apa yang saya miliki entah kelebihan ataupun kekurangan. Bahwasannya semua hal itu bisa diserasikan sehingga tak mengganjal saya untuk meraih kesuksesan. Saya menyukai tantangan baru karena, hemat saya, hidup laiknya ujian yang tak berkesudahan dan hanya dengan begitu saya akan dimatangkan',	'Mengalirlah bersama waktu dan perlahan kita (bisa) diubah olehnya. Sedari kecil saya bermimpi menjadi diplomat ataupun duta besar. Kelihatannya terlampau tinggi memang apalagi, mungkin, bagi saya yang notabene anak petani. Namun, saat saya menjangkarkan mimpi itu, saya percaya bahwa impian tak pernah dipagari oleh sekat geografis apalagi kapasitas finansial seseorang atau keluarga. Agar bisa merealisasikan mimpi itu, sedini mungkin saya cicil \'kumpul alat dan bahannya\'. Paling praktis, saya mesti mempelajari dan meng-aku-kan kecakapan-kecakapan yang dipersyaratkan untuk menjadi diplomat ataupun duta besar. Kecakapan berbahasa asin; kemampuan public speaking yang mumpuni; akrab dengan isu dan perkembangan global; pertajam analisa lewat kegiatan baca-tulis; keahlian bersosialisasi-bernegosiasi; kecakapan kepemimpinan (leadership skill), dan yang paling utama menurut saya adalah menempuh pendidikan dari dasar hingga tinggi. Atas dasar itu pulalah saya meminang jurusan hukum di President University. Hemat saya, kecakapan-kecakapan yang saya punya niscaya tak cukup jika tanpa merengkuh pendidikan formal. Semua prasyarat itu saya harus kuasai. Totalitas. Lebih dari itu saya harus menjadikan semuanya sebagai bagian utuh dari keseharian saya alias keberlangsungan untuk mempraktekannya saya harus jaga. Sebagai rangkaian dari proses tersebut saya tertarik dan antusias melirik dan menyambut Program Beasiswa Youth Break the Boundaries yang berorientasi pada pengembangan diri kaum muda dengan visi utama mencetak pemimpin yang unggul di masa depan. Tampak apa yang saya impikan mendapat dukungan penuh dari pihak pemberi beasiswa Break the Boundaries ini. Sungguh pun, oleh karena itu, saya berharap bisa mendapatkannya. Ya, semua ini tentu masih dalam proses, tapi saya percaya betul semua akan indah pada waktunya dan sang waktu akan menjadwalkan ini terlaksana.\r\n',	'Berorganisasi adalah representasi hidup bermasyarakat juga bernegara dalam konteks yang lebih luas. Meski tak menempati posisi sentral dalam organisasi, sebagai ketua umpamanya, tetap pengalaman berorganisasi menghibahkan banyak nilai berharga. Sekurang-kurangnya hal demikian yang saya rasa tatkala menjadi: wakil ketua Kelompok Minat Retorika (organisasi internal sekolah), anggota OSIS saat menjejali pendidikan SMP-SMA, anggota PUMA LAW (President University Major Association atau HIMA di kampus lain), anggota OMK (Orang Muda Katolik), anggota THS-THM (Tunggal Hati Seminari-Tunggal Hati Maria), dan anggota PUCatSo (President University Catholic Society). Berkaca dari pengalaman hidup berorganisasi memampukan saya untuk: bertanggung jawab atas peran yang diemban, disiplin, kerja dengan tenggat waktu yang jelas, kreatif-inovatif, mematangkan kemampuan kepemimpinan, dan yang paling luhur menyadarkan saya bahwa peran sesama dalam kehidupan bersama. Tak berlebihan jika dikatakan bahwa berorganisasi membuat setiap insan untuk semakin menyadari diri sebagai homo socius, makhluk sosial. Tak sanggup berada tanpa yang lain. Ya, berorganisasi laiknya simulasi kehidupan bermasyarakat. Maka, amat wajar, dalam rangkaian prosesnya tantangan pasti muncul. Saya ingat persis, pada tahun 2019 saya menempati posisi sebagai wakil ketua Kelompok Minat Retorika. Sesuai agenda akan digelar malam pameran kelompok minat, kala itu, maka diperlukan persiapan yang mantap. Respon anggota bervariasi; ada yang antusias, sekelompok orang menanggapi dengan tak terlalu bergairah, yang lain bahkan seolah-olah \'cuek.\' Jika kondisi ini dibiarkan tentu semua hal yang terjadwal bisa terbengkalai. Pada aras ini, saya kerap membantu ketua untuk menggerakan rekan-rekan agar bisa menyukseskan event tersebut. Peran dibagikan, tugas dijelaskan dengan detail, tenggat waktu penyelesaian pekerjaan diberitahukan, serta hal-hal teknis juga diantisipasi persiapannya. Tak hanya sekadar itu, kami yang menggerakan terlebih dahulu menampilkan teladan yang baik dan semangat sehingga antusiasme rekan-rekan juga \'terpancing.\' Ringkas kisah, akhirnya kami bisa menggelar pameran dengan lancar. Sekelumit pengalaman semacam ini, bagi saya, mengindikasikan bagaimana vitalnya kehidupan berorganisasi dalam membentuk karakter pribadi unggul yang bertanggung jawab, disiplin, sukar menyerah, dan konsisten dengan tujuan yang ditetapkan. Kelihatan sederhana memang tapi, begitulah adanya. Saya ingat seorang bijak berujar \"Barangsiapa setia dalam perkara-perkara kecil akan setia pula pada perkara-perkara besar\".',	1,	1654064038,	NULL,	0),
('SCHLR-LFRYS-65d69e',	'USR-LFRYS-9f2f4',	'Alfira Yushardinar Sudrajad',	'2003-02-17',	'81259316295',	'Jalan Papa Hijau No. 39 B, Tulusrejo, Lowokwaru, Kota Malang, Jawa Timur.',	'Ilmu Hukum',	'Universitas Brawijaya',	'4.00',	'2',	'Saya adalah anak kedua dari dua bersaudara. Saya masih memiliki kedua orang tua yang lengkap. Ayah saya adalah seorang karyawan swasta dan ibu saya adalah ibu rumah tangga. Saya adalah seorang mahasiswi berusia 19 tahun di Fakultas Hukum Universitas Brawijaya yang saat ini berada di Semester 2. Saya memilih jurusan ilmu hukum karena jurusan ini merupakan jurusan yang sesuai dengan kemampuan saya, memiliki prospek kerja yang luas dan beragam, serta sesuai dengan cita-cita saya.',	'Setelah lulus kuliah, saya ingin melanjutkan studi S2 ilmu hukum atau kenotariatan baik itu di universitas dalam negeri maupun luar negeri. Saya ingin menjadi dosen dan mendirikan kantor notaris. Selain itu, saya ingin menjadi pengusaha sehingga dapat membuka lapangan pekerjaan yang dapat memberikan kebermanfaatan bagi masyarakat. Untuk mewujudkannya, saya belajar dengan giat dan berusaha sungguh-sungguh selama menjadi mahasiswa agar mimpi saya dapat tercapai. Selain itu, saya juga ingin meringankan beban orang tua saya dengan mendaftar program beasiswa.',	'Ya, saya mempunyai pengalaman organisasi di Badan Eksekutif Mahasiswa Fakultas Hukum Universitas Brawijaya sebagai Staff Ahli dalam Kementerian Teknologi, Komunikasi, dan Informasi yang mempunyai berbagai program kerja yang berkaitan dengan IT. Salah satu contoh program kerja yang sudah terlaksana adalah webinar create your site dimana saya bertugas sebagai MC untuk memandu jalannya acara tersebut. Selain itu, saya juga aktif mengikuti organisasi Lembaga Pers Mahasiswa ManifesT Fakultas Hukum Universitas Brawijaya sebagai Staff Humas Eksternal Bidang Umum, ManifesT memiliki berbagai program kerja dalam bidang kepenulisan dan berita.Salah satu program kerja yang sudah terlaksana adalah webinar how to be a good reporter dimana saya bertugas sebagai penanggung jawab divisi acara.',	1,	1655657132,	NULL,	0),
('SCHLR-LFYHN-2e718b',	'USR-LFYHN-991e4',	'Alifiyah Nurizza',	'2001-10-16',	'81212219919',	'Perum Tamansari Grand Samarinda Cluster Maya Blok G5/12, Kalimantan Timur',	'Fisika/Teknik Geofisika/MIPA',	'Brawijaya University',	'2.95',	'6',	'Experienced on papers and design. Interested on UI/UX manager. Ready to take a risk for another passion. ',	'One of them is helping my family financial needs. Ive been applying job here and there. Opening online marketplace. And ofc joining this event. ',	'Yes i have. I have experienced as a staf and head of HRD Division in my college (RITMA FMIPA UB-Riset Keilmiahan Mahasiswa). I also have experienced as a secretary and steering committee of secretary at P2MF MIPA UB (PKM MABA)',	1,	1653902712,	NULL,	0),
('SCHLR-LHMBS-f17bf4',	'USR-LHMBS-7297f',	'ILHAM BISMA AKBAR MAOLANA',	'2002-12-13',	'81324003117',	'Dusun binangun, Rt/Rw 13/04, Kondangjajar, Cijulang, Pangandaran, Jawa Barat',	'Teknik Informatika',	'Universitas Siliwangi',	'3.42',	'2',	'Saya orangnya tertutup, saya ingin sekali mewujudkan impian saya',	'Orang sukses/berhasil, Ahli IT/Komputer : Bekerja keras dan Bekerja Cerdas',	'Tidak',	1,	1654178928,	NULL,	0),
('SCHLR-LL-c3a038',	'USR-LL-63874f',	'Lili Febriani',	'2003-02-27',	'895422829325',	'Jl. Jangkar Suradadi Kab.Tegal',	'S1-Biologi',	'Universitas Diponegoro',	'3.90',	'2',	'perkenalkan saya Lili Febriani bisa dipanggil Lili. Saya berasal dari Tegal, saat ini saya sedang menempuh pendidikan di Universitas Diponegoro prodi Biologi fakultas sains dan matematika. Dalam kesehariannya saya tinggal dengan kedua orang tua saya. ayah bekerja sebagai nelayan dan ibu tidak bekerja. kesibukan saya akhir-akhir ini karena sebagai mahasiswa maka saya wajib mengerjakan seluruh tugas kuliah saya dan saya sedang menjalankan beberapa tugas kepanitiaan dalam organisasi kampus. ',	'mimpi terbesar saya yakni menjadi orang sukses dimana saya bisa bekerja di bidang sesuai bakat dan minat saya serta dapat membahagiakan kedua orang tua saya dan orang² sekitar saya. untuk mewujudkan mimpi itu saya perlu berusaha semampu saya dengan belajar semaksimal mungkin untuk bisa berprestasi dan menjadi mahasiswa yang aktif.',	'iya benar. sejak smp hingga sekarang sebagai mahasiswa saya mengikuti berbagai organisasi. Saat smp saya menjadi Osis tepatnya sebagai wakil ketua osis dan mengikuti organisasi kepramukaan sebagai sekretaris. kemudian, saat SMA saya melanjutkan untuk kembali menjadi Osis sebagai anggota sekbid. lalu saat ini saya sedang mengikuti UKM niche atau Biro Jurnalistik ditingkat universitas.',	1,	1654013435,	NULL,	0),
('SCHLR-LLND-5a9ba3',	'USR-LLND-feefe2',	'ELLINDA',	'2004-06-05',	'85863360524',	'Sukasari, Subang, West Java',	'Informatics',	'Indonesian Digital Technology ',	'0',	'1',	'Saya adalah seorang mahasiswa baru, jurusan Informatika di salah satu Perguruan Tinggi di Yogyakarta. \r\nSaya sangat aktif mengikuti organisasi. karena pribadi yang aktif saya selalu mencari kesibukan yang bermanfaat bagi diri saya. ',	'mimpi saya ingin menjadi programmer, cara untuk mewujudkannya dengan gigih belajar dan banyak mengkitu course tentang teknologi dan komputer',	'Ya, saya mempunyai pengalaman  dalam Organisasi Pramuka. saya menjabat sebagai wakil ketua pada saat itu, selama 1 tahun menjabat. banyak manfaat yang saya dapat dari organisasi pramuka, pengetahuan, pengalaman, public speaking, attitude, dll.\r\nsaya juga pernah menjadi Relawan Banjir, pada saat daerah sekitar saya terkena banjir, saya ikut serta membantu korban banjir. dengan melakukan pengumpulan barang-barang yang masih layak pakai (seperti, pakaian). ',	1,	1653569938,	NULL,	0),
('SCHLR-LLRHM-8799b7',	'USR-LLRHM-00da3',	'Lulu rohmatun nazilah',	'2003-11-12',	'82289386016',	'Dusun 01 Kelahang, RT 01/RW 01, Desa Labuhan Ratu VIII, Keacamatan Labuhan Ratu, Kabupaten Lampung Timur, Provinsi Lampung',	'Jurusan Ilmu Pendidikan Progra',	'Universitas Lampung',	'4.00',	'2',	'Saya adalah anak pertama dari pasangan Ibu Siti Napsiah dan Bapak Muhammad Darsun, saya tinggal di kampung tepatnya di sebuah Desa Labuhan Ratu VIII Lampung Timur, Provinsi Lampung bersama ibu dan adik saya. Ayah saya telah meninggal dunia sejak 5 tahun yang lalu tepatnya di tahun 2017 akibat insiden kecelakaan mobil Bersama 8 orang rekannya yang melibatkan 1 orang tewas dan 7 orang lainnya luka berat. ibu saya seorang pengajar honorer di SD N 6 Rajabasa Lama. Sedangkan adik saya saat ini berusia 8 tahun dan sedang menempuh Pendidikan sekolah dasar kelas III di SD N 6 Rajabasa Lama. Sebelumnya perkenalkan nama saya adalah Lulu Rohmatun Nazilah, gadis keturunan jawa yang tinggal di Lampung dimana tahun ini saya menginjak usia 19 tahun, saya merupakan mahasiswi Universitas Lampung dengan prodi PGSD. Menurut orang terdekat saya, saya merupakan seseorang yang ekstrovet, mudah beradaptasi dan menyukai anak kecil. Oleh karena itu menjadi seorang pengajar saya rasa sangat cocok dengan karakter saya yang ekstrovet, mudah bergaul dan juga mudah beradaptasi',	'mimpi terbesar saya adalah ketika saya dapat melahirkan anak anak bangsa yang cerdas dan bermutu, selain itu saya juga ingin menjadi seseorang yng sangat bermanfaat untuk orang lain. dengan begitu menjadi seorang guru adalah keinginan saya sejak beberapa tahun silam. dengan menjadi seorang guru pastinya saya dapat nmewujudkan mimpi saya mulai dari menjadi bermanfaat untuk orang lain dan juga menjadikan anak-anak negeri menjadi anak-anak yang berbudi pekerti, bermutu dan bisa menjadi pemimpin bangsa suatu saat. saya juga ingin memberikan ilmu saya kepada anak anak di daerah pelosok karena pendidikan adalah hak mereka, keterbatasan wilayah bagi saya bukanlah suatu alasan bagi seorang anak untuk mereka kehilangan hak belajar mereka',	'iya saya memiliki pengalaman organisasi dan juga relawan, di kampus saya bukanlah mahasiswa yang hanya kuliah pulang, tetapi saya juga mengikuti banyak sekali organisasi, di organisasi juga tak jarang saya menjadi panitia, mulai dari MC ataupun moderator. saya juga memiliki pengalaman di bidang relawan, yaitu saya pernah mengikuti kegiatan kerelawanan di sebuah panti asuhan as-salam di kabupaten Lampun Selatan yaitu berbagi al-quran dan Ira yang di selenggarakan oleh komunitas bernama Nuwokarya Id yang berkolaborasi dengan dompet dhuafa Lampung',	1,	1653622495,	NULL,	0),
('SCHLR-LLSNP-7ebe01',	'USR-LLSNP-9c825',	'Lilis Nopita Sari',	'2002-11-27',	'85641120299',	'Dusun Glompong RT 02 RW 03, Ds. Tempuran, Kec. Bringin, Kab. Semarang, Jawa Tengah',	'Teknik Perkapalan',	'Universitas Diponegoro',	'3.81',	'4',	'Saya Lilis Nopita Sari mahasiswa semester 4 S1 Teknik Perkapalan Universitas Diponegoro. Saat ini saya berusia 19 tahun. Saya merupakan anak terakhir dari 5 bersaudara. Saya dan keluarga saya bukan merupakan orang yang berkecukupan. Sejak kecil saya sudah terbiasa hidup pas-pasan dan seadanya. Hal itulah yang membuat saya tumbuh menjadi anak yang mandiri. Keterbatasan ekonomi tidak membuat saya merasa minder atau putus asa. Sejak kelas 2 SD saya selalu berhasil mendapatkan peringkat 1 di kelas hingga pada saat saya SMA. Saya juga sering mengikuti lomba mewakili sekolah saya. Beberapa lomba yang pernah saya menangkan yaitu juara 2 lomba cipta cerpen tingkat kabupaten, juara 3 lomba cerdas cermat, dan beberapa lomba baris berbaris, serta lomba Pramuka. Saya merupakan tipe orang yang pekerja keras, mandiri, bertanggung jawab, dan tegas. Saya selalu berusaha memberikan yang terbaik agar kedua orang tua saya bangga dengan prestasi yang bisa saya raih. Saya merupakan pecinta binatang terutama kucing. Saya menyukai alam dan senang menjelajahi alam bebas.',	'Mimpi terbesar saya adalah mengangkat derajat keluarga saya. Membuat kedua orang tua saya bangga melihat anak gadisnya sukses. Saya merupakan anak terakhir sekaligus harapan terakhir. Maka dari itu saya nekat berkuliah. Bukan tanpa alasan, saya melakukan itu karena saya memikirkan kehidupan kedepannya. Saya selalu berusaha belajar dengan maksimal dan memahami setiap materi yang disampaikan oleh dosen. Tidak hanya itu, saya juga mengimbangi dengan mengasah soft skill dengan bergabung dalam organisasi dan kegiatan kepanitiaan. Selain itu, saya juga aktif mengikuti berbagai seminar dan pelatihan. Itu semua saya lakukan untuk mempersiapkan diri saya dalam dunia kerja nantinya.',	'Saat saya SMP saya pernah menjabat sebagai wakil ketua OSIS selama 1 periode. Saat SMA, saya menjadi anggota OSIS dan ketua Putri Pramuka. OSIS mengajarkan saya bagaimana cara untuk berpikir kritis, berkreasi, berinovasi, dan membuat sebuah event. Pramuka mengajarkan saya menjadi orang yang cekatan,  berani, menyatu dengan alam, tegas,  dan kekeluargaan. Suatu tantangan bagi saya karena mengikuti 2 organisasi sekaligus. Saya harus pandai mengatur waktu agar tidak tertinggal dalam segi akademik. Dan akhirnya saya mampu menyelesaikan semuanya dengan baik. Saat ini saya bergabung dengan Himpunan mahasiswa teknik perkapalan periode 2022 di bidang kesejahteraan mahasiswa yaitu bidang yang melayani mahasiswa dari segi akademik, UKT, hingga info-info tentang akademik, lowongan kerja, dan beasiswa.',	1,	1655441594,	NULL,	0),
('SCHLR-LLSNR-7bf61f',	'USR-LLSNR-a1213',	'Lilis Nurjanah',	'2004-01-12',	'85841807584',	'Pekon Soponyono',	'IPA',	'MAN 1 Tanggamus',	'3.75',	'6',	'Saya lulusan tahun ini dari sekolah MAN 1 Tanggamus, saya mengambil jurusan  Ilmu Pengetahuan Alam sesuai dengan minat saya yang lebih dominan pada eksakta.\r\n\r\nBidang ini sesuai dengan apa yang saya sukai sejak kecil: menghitung, mempelajari hal baru, dan meneliti kekonkritan pada suatu nilai. \r\n\r\nSaya juga mengikuti banyak kegiatan ketika di sekolah, seperti ikut serta dalam berorganisasi dan kepemimpinan. Contohnya saya mengikuti organisasi OSIS, Rohis, dan juga Tahfidz Qur\'an. Saya juga pernah menjabat sebagai ketua putri dari organisasi Tahfidz yg memberikan saya banyak sekali pengalaman yang berharga.',	'Saya memiliki mimpi untuk bisa menjadi perempuan yang mandiri dan bisa membantu banyak orang. Saya sangat ingin untuk bisa mematahkan persepsi jadul yang masih ada di desa tempat saya tinggal, saya ingin membuktikan bahwa seorang perempuan pun bisa untuk memiliki masa depan yang cerah, saya ingin membuktikan bahwa tidak ada halangan gender untuk mengukir masa depan. Saya akan mencoba mewujudkannya dengan kuliah, membangun relasi dengan banyak orang, dan terus semangat untuk mempelajari hal baru. Saya akan terus berusaha untuk ikut berkembang dan berpartisipasi dalam organisasi yang akan membawa saya pada kebaikan dan menambah wawasan.',	'Ya, saya pernah mengikuti organisasi OSIS, Rohis dan Tahfidz Qur\'an ketika di sekolah. Tidak hanya yang dilakukan ketika di organisasi Tahfidz dan Rohis, disini saya belajar lebih banyak mengenai agama. Tetapi di organisasi OSIS saya belajar lebih banyak lagi mengenai sosial, ikut serta dalam memberikan bantuan pada bencana alam yang menimpa beberapa tempat di daerah saya, memberikan bantuan berupa kebutuhan pokok kepada masyarakat yang kurang mampu, serta ikut dalam upaya mengaktifkan kembali siswa-siswi di sekolah kami di era pandemi yang tengah terjadi.',	1,	1655697242,	NULL,	0),
('SCHLR-LMHRW-7fb4b4',	'USR-LMHRW-0cd34',	'Alma Herawati',	'2001-05-24',	'85694094541',	'Jl M Kahfi I GG film RT 008/004 Jagakarsa, Jakarta Selatan',	'Manajemen/Ekonomi & Bisnis',	'Universitas Nasional',	'3.64',	'4',	'Saya adalah orang yang senang dengan hal baru, karena segala ketakutan yang ada pada diri kita akan kita kalahkan dengan rasa keberanian yang ada dalam diri kita. Sehingga kita perlu mengexplore apa saja hal\" baru untuk mendapatkan pengalaman baru',	'Mimpi terbesar saya adalah bisa melanjutkan kuliah S2 di luar negeri, dan saya mewujudkannya dengan belajar bahasa inggris karena saya tau bahasa Inggris saya belum memenuhi persyaratan untuk apply beasiswa ke luar negeri, tetapi saya tidak putus semangat untuk terus belajar bahasa Inggris ',	'Untuk saat ini saya belum punya pengalaman organisasi selama kuliah, tetapi saat sekolah dulu saya pernah menjadi relawan kesehatan dimana saya melakukan pengecekan kesehatan terhadap masyarakat dilingkungan RT',	1,	1654227195,	NULL,	0),
('SCHLR-LMKHR-b2bea8',	'USR-LMKHR-55743',	'Ilma Khoiro M',	'2003-05-13',	'85748281287',	'Jember',	'Ilmu Keperawatan ',	'Universitas Jember',	'3.19',	'2',	'\r\nsaya seorang pemuda yang berasal dari keluarga sederhana, saya suka membantu dan minat saya dapat mengikuti suatu program yang dapat membantu  saya dalam mencapai keinginan saya yaitu untuk membantu sesama dalam berbagai aspek.\r\n',	'mimpi terbesarku adalah menjadi seorang perawat yang profesional agar bisa menolong dan membantu sesama dengan kemampuan yang saya punya, terutama dalam hal kesehatan. agar mimpi saya dapat terwujud yaitu akan belajar lebih giat lagi, mengikuti program/organisasi/lomba dalam dunia medis seperti pelatihan kegawat-daruratan bencana dan sebagainya.',	'saat SMA saya pernah mengikuti Program Abdi Masyarakat(PAM) pada pesantren kecil di desa selama 1 bulan, saya dan tim melakukan tugasnya yaitu membantu masyarakat di daerah sana dalam hal pengetahuan baik tentang agama maupun umum. yaitu: mengajari anak-anak di sekolah dasar, mengisi pengajian/solawatan bagi para ibu2, mengajar dan membantu santri-santri dalam berbagai hal, membuat program pengajian yang di ikuti oleh seluruh santri dan rakyat di desa tersebut dengan pemateri syekh dari Mesir. Saat kuliah saya mengikuti organisasi kandaga, yaitu organisasi tentang korps pelatihan kebencanaan dan kegawat daruratan dan mengikuti organisasi NSC(Nursing Study Club) yaitu tentang kepenulisan seperti essai ilmiah, KTI, poster ilmiah/publik, nursing olympiad dan sebagainya.',	1,	1654138586,	NULL,	0),
('SCHLR-LMMNH-bfea5d',	'USR-LMMNH-a715f',	'Elmmin Harefa',	'2001-02-08',	'81292961041',	'Jelambar baru jln p no 44 RT 03 RW 02',	'Manajemen',	'Universitas Bina Sarana Inform',	'4.00',	'4',	'Perkenalkan saya Elmmin Harefa. Selama berkuliah di Universitas Bina Sarana Informatika, dengan mengambil konsentrasi Manajemen pemasaran Mata kuliah favorit saya adalah manajemen sumber daya manusia yang mempelajari tentang bagaimana peranan serta hubungan manusia yang ada dalam membantu pencapaian tujuan dari organisasi maupun perusahaan yang berkaitan dengan posisi marketing. Selama berkuliah saya selalu mengikuti perkuliahan dengan sangat baik sehingga saya mampu mempertahankan nilai saya dari semester 1-4 dengan IPK 4.00. Dan saat ini kegiatan saya selain berkuliah adalah ngajar les, saya suka mempelajari hal-hal baru, jadi selain fokus untuk mempelajari marketing di perkuliahan saya juga melatih diri saya untuk menyampaikan atau menjelaskan sesuatu kepada orang lain dengan baik agar mudah dimengerti, selain itu saya juga suka membagikan ilmu yang saya dapat kepada orang lain supaya ilmu yang saya dapatkan dapat juga bermanfaat bagi orang lain maupun diri saya sendiri.',	'Membangkitkan semangat anak muda untuk lebih rajin belajar dan mau mempelajari hal-hal baru. Saya ingin mereka yang masih mengabaikan sekolah mau mengubah mindset mereka tentang betapa pentingnya sekolah dan ilmu untuk masa depan mereka. Khususnya di kampung saya, disana masih banyak anak-anak yang tidak mau belajar dan orang tua yang mengaggap sekolah itu tidak penting. Saya ingin membantu mereka dengan memberikan motivasi-motivasi yang dapat mengubah mindset mereka, sehingga mereka mau belajar dengan giat agar tidak ketinggalan jauh dengan anak-anak yang tinggal di kota. Dengan pengalaman yang saya mengajar les saya dapat membantu mereka mengajari hal-hal baru.',	'Pada tahun 2019 saya dipilih menjadi sekretaris di acara natal pemuda gereja, selama saya menjadi sekretaris saya melakukan tugas saya dengan sangat baik, mulai dari latihan hingga acar natal selesai. Selain itu saya juga membantu bendahara untuk mengumpulkan dana dengan memasak dan berjualan sayur, kue serta minuman jahe kepada masyarakat dan hasil jualan kami melebih target yang telah kami targetkan, sehingga dana yang masuk lebih besar dari pengeluaran.',	1,	1653982539,	NULL,	0),
('SCHLR-LMRZK-64deff',	'USR-LMRZK-da9bd',	'AL-MURIZKA ANNISA',	'2004-06-29',	'85260149040',	'Sumatera Utara',	'Pendidikan IPA',	'Universitas Negeri Medan',	'0.00',	'1',	'Aku adalah anak perempuan pertama dari keluarga sederhana, aku memiliki hoby menyanyi serta membaca, belakangan ini aku sering menghabiskan waktuku untuk belajar menggunakan bahasa Inggris.',	'Mimpiku sederhana yakni menjadi seorang guru yg kedepan nya akan melahirkan murid murid yg pintar (akademis/non-akademis) dan bermoral. Caraku mewujudkan nya dengan melanjutkan pendidikan ku ke jenjang yang lebih tinggi dan mengambil S1 kependidikan.',	'Sewaktu aku mondok di Pesantren aku pernah bergabung dalam organisasi siswa intra sekolah (osis) awalnya aku merasa bahwa terpilih menjadi anggota osis adalah beban, tapi lama kelamaan aku banyak belajar tentang sebuah tanggungjawab, kekompakan, adab, semua nya aku dapatkan. Aku dan teman-temanku pernah menginap semalaman di ruang kantor smp karena ingin menyiapkan acara untuk hari guru, selama malam berlalu disitulah rasa takut, deg\" an, terus takut gk siap semua nya, bercampur aduk, dan alhamdulillah semua bisa kami lalui dengan lancar karena adanya kekompakan dan rasa tanggungjawab terhadap sebuah pekerjaan.',	1,	1654266142,	NULL,	0),
('SCHLR-LNMRN-26c18b',	'USR-LNMRN-b44df',	'LINA MARINA TAMBUNAN',	'2001-08-22',	'89673234618',	'PONDOK PRATIWI III BLOK GG NO 20 SEKUPANG BATAM',	'Fakultas Ekonomi prodi Akuntan',	'Universitas Negeri Medan',	'3.07',	'4',	'Perkenalkan nama saya Lina Marina Tambunan. Saya seorang mahasiswi semester 4 di Universitas Negeri Medan, saya berdomisili di batam. Selain menjadi seorang mahasiswi saya juga mengikuti program volunteer. Sekian perkenalan dari saya terimakasih',	'Mimpi terbesar saya adalah ketika lulus kuliah nanti saya iberencana ingin melamar dan bekerja di perusahaan BUMN sekaligus ingin mengharumkan nama baik orang tua saya dan membahagiakan mereka ketika saya sukses nanti.',	'Benar sekali. 2 hari yang lalu saya lolos menjadi bagian Youthpad Ambassador Indonesia',	1,	1653498429,	NULL,	0),
('SCHLR-LNTNG-926926',	'USR-LNTNG-5272f',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654015395,	NULL,	0),
('SCHLR-LRDH-1e67ec',	'USR-LRDH-1eb143',	'Ali Ridho',	'2001-08-20',	'87837680933',	'Jl. Truntum Klego, Pekalongan',	'Teknik Elektro',	'Universitas Diponegoro',	'3.41',	'4',	'Hai! Saya Ali Ridho, mahasiswa yang sebentar lagi akan memasuki semester 5 di Departemen Teknik Elektro Undip. Saya berasal dari keluarga yang terbilang pas-pas an. Kendati demikian, orang tua saya berjuang dengan sangat untuk menyekolahkan saya hingga ke perguruan tinggi. Sebagai anak sulung, saya diharapkan agar bisa mencapai kehidupan masa depan yang lebih baik. Hal inilah yang menjadi salah satu bahan bakar bagi saya untuk selalu semangat mengejar kesuksesan. Untuk dapat mewujudkannya, saya berharap dapat menjadi bagian dari YBB FOUNDATION SCHOLARSHIP ini yang mana memberikan kesempatan untuk meningkatkan diri, memperluas relasi, mendapatkan bimbingan serta bantuan finansial yang mana dapat meringankan beban biaya kuliah saya.',	'Sesuai dengan minat saya pada teknologi IoT dan digitalisasi, saya berkeinginan untuk mendapatkan posisi penting di perusahaan IT raksasa baik di dalam maupun di luar negeri. Tak menutup kemungkinan untuk mendirikan start up sendiri dan mengembangkan hingga dapat bersaing dengan perusahaan besar yang sudah ada.\r\nDemi mewujudkan hal tersebut, saat ini saya sudah mulai berlatih mengenai mengenai programming dengan mengambil course online dan tutorial di internet yang tersedia secara gratis. Setelah memantapkan skill dasarnya, saya akan mencoba mengerjakan project mandiri dan ikut program internship untuk mengasah skill lebih jauh serta menambah pengalaman dan relasi. Mendaftar YBB FOUNDATION SCHOLARSHIP juga merupakan salah satu upaya saya, karena dengan dukungan dan bimbingan dari YBB FOUNDATION akan sangat membantu saya mencapai mimpi saya.',	'Selama diperkuliahan, saya (bersama teman-teman seangkatan saya) pernah beberapa kali berpartisipasi dalam acara sosial seperti galang dana untuk disumbangkan ke panti asuhan. Ada juga kegiatan penanaman bibit pohon dan webinar bertema \"Healing the Nature\" dalam acara Persephone Fest 2022 yang pernah saya ikuti di awal tahun ini.',	1,	1655734341,	NULL,	0),
('SCHLR-LRNT-69b4ad',	'USR-LRNT-6ab097',	'laurentia alexandra saragih',	'2004-01-22',	'87894169309',	'Perumahan Sibatu- batu Indah blok G no. 3, Kec. Siantar Sitalasari, Kelurahan Bahkapul, Kota P. Siantar, Sumatera Utara',	'Oseanografi',	'Universitas Diponegoro',	'3.65',	'1',	'Nama saya Laurentia Alexandra Saragih, asal dari Sumatera Utara, saya adalah anak kedua dari tiga bersaudara.Saya merupakan mahasiswa Universitas Diponegoro jurusan Oseanografi tahun 2021. Pada saat menjelang kelulusan SMA saya memiliki keinginan agar dapat menempuh pendidikan di perguruan tinggi negri Indonesia. Saya berasal dari pematang siantar yang mana wilayahnya jauh dari perairan pantai. namun, saya memiliki obsesi pada pantai, hingga akhirnya saya memutuskan untuk mendalami tentang bidang ini. ',	'Saya memiliki cita- cita untuk menjadi sorang wanita Indonesia yang ahli dalam pemetaan laut Indonesia. Maka dari itu usaha yang saya lakukan adalh dengan belajar yang mencakup bidang kelautan dan juga mencari pengalaman sebanyak- banyaknya.',	'Pada Tahun 2021 saat masih dilaksanakan pemberlakuan pembatasan kegiatan masyarakat (PPKM) ada sebuah kegiatan untuk membantu para penintas, dan juga UMKM yang terkena dampak dari Pandemi. Disana saya mendapatkan banyak pelajaran dan juga pengalaman yang berharga.',	1,	1655309082,	NULL,	0),
('SCHLR-LSCHY-cb22bb',	'USR-LSCHY-0daa6',	'Elisa Cahya Muliawati ',	'2002-08-29',	'85100968324',	'Jalan Teluk Grajakan 135B, Kecamatan Blimbing, Kelurahan Pandanwangi, Kota Mlaang 65124',	'Manajemen Kewirausahaan Fakult',	'Universitas Brawijaya',	'3.87',	'5',	'Saya merupakan pribadi yang kontributif dalam berbagai kegiatan, baik organisasi, kepanitiaan, volunteer, maupun internship dalam lingkup kampus hingga luar kampus. Saya belajar bagaimana menjadi pribadi yang tak takut untuk mencoba, memiliki rasa percaya diri dan keberanian untuk maju dan berkembang. Hasil dari tekad saya yang keluar dari zona nyaman, maka saya bisa belajar bagaimana menjadi pribadi yang disiplin, memiliki time management yang baik, hingga memiliki passion untuk berbicara didepan umum (public speaking). Tak terlupa, saya belajar bagaimana berkontribusi untuk ranah masyarakat dan sekitar sehingga dapat meningkatkan value yang ada di diri saya dan bermanfaat bagi sekitar',	'Mimpi saya adalah mendirikan suatu startup di bidang pendidikan, dengan mengikuti berbagai kegiatan pengembangan di bidang tersebut seperti seminar, workshop, dan mengikuti kegiatan magang di platform yang mengembangkan pendidikan',	'1. Young On Top Malang\r\n- Membuat content writer setiap 1 bulan selama 4x\r\n- Bekerjasama dengan pihak eksternal sejenis\r\n2. Bangun Pendidikan Indonesia\r\n- Membuat proposal untuk kerjasama dengan platform sejenis lainnya',	1,	1655698755,	NULL,	0),
('SCHLR-LSDNR-8a74b5',	'USR-LSDNR-21475',	'Elsa Diana Rahmawati',	'2001-04-25',	'85865854809',	'Dukuh Randu 004/004, Desa Kutoharjo, Pati, Jawa Tengah',	'Pendidikan Bahasa dan Sastra J',	'Universitas Negeri Semarang',	'3.45',	'2',	'Yth. Panitia Penyelenggara Progam Beasiswa\r\nSuatu kebanggaan bagi saya mahasiswa pertama dalam silsilah keluarga saya walaupun tidak mudah untuk menggapainya. Perkenalkan nama saya Elsa Diana Rahmawati. Saya anak pertama dari dua bersaudara. Saya dibesarkan dalam keluarga yang sederhana. Bapak saya hanya lulusan sd dan bekerja sebagai buruh pabriksedangkan Ibu saya hanya ibu rumah tangga biasa pada umumnya, karena adik saya masih sekolah (SMP) dan ekonomi keluarga yang kurang stabil mengharuskan saya untuk langsung bekerja sejak lulus SMK. Hal ini masih berlanjut hingga saya berstatus sebagai Mahasiswa. Saya tidak ingin membebani kedua orang tua saya dalam menyelesaikan studi kuliah saya saat ini karena itu saya sangat termotivasi untuk bergabung dalam Beasiswa Pemuda YBB Foundation. ',	'Saya bercita-cita menjadi seorang guru. Setelah lulus SMK saya langsung bekerja di Toko Mainan anak-anak, hasil dari bekerja itu saya tabung untuk bimbel. Saya bimbel di Marvin selama satu tahun untuk mengikuti UTBK, jelas tidak mudah bagi anak SMK untuk masuk kedunia perkuliahan, karena itu saya belajar dengan konsisten setiap hari tak lupa diiringi doa alhamdulillah sekarang saya bisa menginjak bangku perkuliahan di UNNES dengan mengambil prodi Pendidikan Bahasa dan Sastra Jawa. ',	'Saya mengikuti organisasi Remaja Masjid di desa saya. Dalam organisasi tersebut terdapat kegiatan arisan setiap dua kali dalam satu bulan untuk mempererat hubungan sesama anggotanya. Salah satu kegiatan tahunan kita yaitu takbir keliling saat bulan Ramadhan. Tugas kita mulai dari membuat proposal kegiatan, susunan acara, dan konsumsi. Berhubungan langsung dengan masyarakat dan anak-anak yang mengikuti kegiatan takbir keliling dan saya sebagai pemandunya menurut saya itu seru sekali',	1,	1655737902,	NULL,	0),
('SCHLR-LSHLW-5f58a3',	'USR-LSHLW-573c9',	'Ilusi Halawa',	'2003-08-25',	'81295212882',	'Jalan Kamboja no 27 Depok',	'Teknik Mesin',	'Universitas Gunadarma',	'3.16',	'2',	'Saya anak laki-laki yang sedang kuliah dan bertempat tinggal di panti asuhan',	'Mimpi terbesar saya adalah dapat membanggakan orang tua dan dapat membantu orang lain seperti yang mereka lakukan sekarang ini kepada saya, dengan cara saya harus belajar dan berusaha sungguh-sungguh',	'Belum memiliki pengalaman seperti itu',	1,	1653557005,	NULL,	0),
('SCHLR-LSNGG-126563',	'USR-LSNGG-f7248',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654504006,	NULL,	0),
('SCHLR-LSNLS-bd4bbb',	'USR-LSNLS-e5364',	'Liesna Lusyana Nur',	'2001-05-10',	'89501429899',	'Jl. Raya Sukaraja-Cibentar No. 76, RT/RW 02/04, Jatiwangi, Majalengka',	'Gizi',	'Universitas Jember',	'3.83',	'6',	'Saya memiliki keterampilan teknis yang kuat serta keterampilan interpersonal yang sangat baik. Saya bersemangat untuk belajar hal-hal yang baru, saya menikmati mengatasi tantangan, dan saya memiliki inisiasi yang tinggi. Aktif, inovatif, kreatif, memiliki komunikasi yang baik suka menulis dan suka mencari alternatif solusi. Bersikap realistis dalam menetapkan target atau tujuan dan selalu berusaha untuk mencapai tujuan tersebut dengan cara yang baik dan efisien.',	'Mimpi terbesar saya adalah ingin melihat kembali nangis terharu bangga dari orang tua dengan melihat kesuksesan yang diraih oleh saya. Adapun cita-cita yang harapannya dapat membuat tangis haru bahagia adalah dengan menjadi ahli gizi yang membuka praktiknya sendiri dengan bekerja sama dengan dokter spesialis serta memiliki catering sehat. Tentunya semua mimpi tersebut dapat tercapai melalui proses dan ikhtiar yang kuat. Adapun cara saya dalam mewujudkannya yakni dengan belajar dengan rajin dan aktif di kelas, serta mencari peluang kesempatan yang dalam meningkatkan kompetensi saya seperti di ranah organisasi, volunteering dan kompetisi.',	'Iyaa, saya memiliki pengalaman organisasi dan juga relawan. Adapun pengalaman organisasi yang saya miliki yakni :\r\n• Organisasi Healtheen sebagai Public Speaker (2021 – Sekarang)\r\n• Organisasi Anuvastudy sebagai Mentor UTBK Biologi (2021-Sekarang)\r\n• Organisasi Pemburu Beasiswa S2 Staff divisi Program (2021 – Sekarang)\r\n• Organisasi Kami Kreator sebagai mentor public speaking (2022)\r\nSedangkan untuk riwayat menjadi relawan, yakni :\r\n• Fasilitator bidang kesehatan di Inspirasi Negri 3 ke Lombok (18-25 Desember 2021)\r\n• Koordinator Kesehatan Bakti Milenial ke Lombok titik 2 Desa Batu Putih, Sekotong Barat, Lombok Barat (20-30 Agustus 2021)\r\n• GPI (Gizi Peduli Indonesia) diselenggarakan oleh ILMAGI (Ikatan Lembaga Mahasiswa Gizi Indonesia) (22-23 Mei 2021)',	1,	1654954780,	NULL,	0),
('SCHLR-LSTNV-7fdced',	'USR-LSTNV-823c2',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655742446,	NULL,	0),
('SCHLR-LSTNV-ab3d76',	'USR-LSTNV-823c2',	'Listiana Evilia Sefriani',	'2003-04-06',	'85377613557',	'Desa Keben RT.01/RW.04 Kec.Tambakromo Kab.Pati Jawa Tengah',	'Agribisnis Fakultas Peternakan',	'Universitas Diponegoro',	'3.55',	'2',	'Saya adalah seorang mahasiswa semester 2 jurusan agribisnis universitas Diponegoro, saat ini saya juga belajar agama di salah satu pondok pesantren yang ada di Semarang. Kuliah sambil mondok tentu tantangan tersendiri bagi saya. Walaupun demikian hal itu tak pernah membatasi saya untuk tetap aktif dan berprestasi. Saat ini saya mengikuti salah satu UKM yang ada di universitas saya. Saya juga memanfaatkan waktu luang saya dengan mengikuti pelatihan, webinar, dan beberapa kepanitiaan.',	'Mimpi terbesar saya adalah dapat memberikan perubahan besar terhadap sistem pertanian yang ada di Indonesia terutama di desa saya. Yang mana masih sangat kurang akan penerapan sistem teknologi pertanian. Tak hanya itu, banyaknya hasil bumi yang melimpah membuat masyarakat berinovasi membuat makanan ringan. Namun pasarnya masih sangatlah terbatas, oleh karena itu saya tergerak untuk membantu UMKM yang ada di desa saya dan masyarakat sekitar.',	'Saya memiliki pengalaman organisasi di UKM yang saya ikuti. Kegiatan yang diselenggarakan seperti adanya acara milad, seminar, kajian rutin dll. Selain itu saya juga pernah mengikuti beberapa kepanitiaan baik diluar universitas dan dalam pondok pesantren saya saat ini.',	1,	1655742620,	NULL,	0),
('SCHLR-LSY-5f5d21',	'USR-LSY-6750c7',	'ELSA AYU',	'2004-04-04',	'859162628083',	'Jl. Raya Pitara gg. sirih kuning 3 RT/RW 006/015 Pancoran Mas Kota Depok ',	'X-OTKP 1',	'SMK NEGERI 3 DEPOK ',	'3.3',	'2',	'Assalamualaikum perkenalkan saya Elsa Ayu siswi kelas 10 Jurusan OTKP di SMK Negeri 3 Depok.Saya lahir di Jakarta dan pindah serta tinggal di Depok setelah ayah meninggal. Saya anak pertama dari 2 bersaudara, saya tinggal bersama mamah, nenek, serta adik. Saya sering mendapatkan juara kelas dari SD,  SMP, SMK, tapi saya pernah down. Saya pernah mengikuti program cerdas cermat pada tingkat SD dan SMP. Cita-cita saya adalah saya dapat menjadi pengusaha sukses di masa depan. Karena ekonomi saya pernah putus sekolah maka dari itu saya berjuang untuk lulus SMK serta melanjutkan keperguruan tinggi dengan mandiri adalah impian terbesar saya.',	'Impian terbesar saya adalah 3  faktor saya untuk maju\r\n1. mengenyam pendidikan yang lebih tinggi, melanjutkan ke perguruan tinggi tanpa membebani mamah atau keluarga.\r\n2. Saya ingin dapat mewujudkan setiap impian, harapan, hajat, doa, dan dapat membahagiakan orang tua, keluarga, orang yang mensuport dan saya bisa mewujudkan setiap mimpi saya. \r\n3. Saya memiliki rencana untuk membangun usaha dan bisnis agar saya mampu membantu menciptakan lapangan pekerjaan bagi orang yang membutukan. Selain pekerjaan saya ingin banyak berkontribusi membantu setiap anak mewujudkan mimpinya\r\n\r\nmencapai keberhasilan dan keinginan agar terwujud bukanlah hal yang mudah, pasti banyak rintangan dan masalah yang harus siap dihadapi. Hal yang harus dilakukan untuk mencapai itu banyak sekali Dari sekarang saya harus menyiapkan menset atau tujuan sebenarnya, selain itu berdoa ibadah ataupun bersedekah menjadi mempermudah setiap langkah. Dorongan, motivasi, harapan dan kasih sayang dari orang tua ataupun orang-orang terdekat menjadi penyemangat. Kritik, ejekan, penolakan, kekalahan ataupun hal semacamnya bukan menjadi penghambat seseorang meraih kemenangan dalam hidupnya tetapi menjadi pendorong bagaimana saya harus merubah kehidupan saya menjadi lebih baik dari pendapat orang lain. Membaca peluang secara cermat, membagi waktu sebaik mungkin seperti hal nya api pada lilin yang akan redup apinya jika lilin nya habis, jika saja api itu digunakan untuk hal berguna maka api tersebut bisa saja terus menyala. Kerjasama, tetap positif, saling tolong menolong, tidak adanya yang membedakan, tidak menyepelekan orang lain dan sikap positif lainnya seharusnya juga salah satu langkah dalam mencapai tujuan keberhasilan hidup. Saya selalu percaya bahwa kesempatan tidak datang begitu saja. Kesempatan harus dijemput dengan langkah yang berani dan hati yang siap. Selain itu tuhan akan memberikan jalan dan membuka pintu kesempatan bagi orang yang ingin berubah. ',	'Jujur saya tidak pernah mengikuti organisasi ataupun relawan, hanya mengikuti ekstrakurikuler, dan saat saya mengikuti ekstrakurikuler Pramuka, Paskibra, PMR, Bultang, dan bahasa, saya keluar setalah 3-4 bulan karena saya membantu mamah berjualan, walaupun setengah hati saya merasakan penyesalan, tapi saya juga mendapatkan pelajaran saat berjualan bersama-sama dan saya banyak menemukan kisah perjuangan orang-orang. Setiap pekerjaan atau yang orang lakukan sebenarnya sama hanya saja tempat nya yang berbeda dan pandangan penilaian orang-orang. Saya mungkin tak pernah menjadi relawan tapi saya yakin saya bisa membantu dengan kemampuan yang miliki.',	1,	1655523892,	NULL,	0),
('SCHLR-LT-da7cc4',	'USR-LT-79c7b2',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654045996,	NULL,	0),
('SCHLR-LTFNN-d0c266',	'USR-LTFNN-1e159',	'Lutfi Annisa Fitri',	'2001-01-17',	'85875862905',	'Ngrancang Rt04 Rw07 Kec. Mantingan, Kab. Ngawi Jawa Timur',	'Administrasi Publik Fakultas I',	'Universitas Islam Negeri Sunan',	'3.68',	'4',	'saya merupakan seorang individu yang bisa memanagement waktu dengan baik dibuktikan dengan saya bisa mengerjakan semua tugas tepat waktu. saya merupakan seorang individu yang bisa mencapai target dibuktikan dengan IPK saya 3.68. saya merupakan seorang individu yang terbiasa bersosialisasi dibuktikan dengan saya mengikuti kegiatan organisasi selama SMA. saya merupakan seorang individu yang dapat mengambil keputusan yang tepat. saya seorang individu yang pelupa, walaupun pelupa saya selalu menuliskan jadwal saya di note supaya lebih terorganisir.',	'- Bisa kuliah S1, S2, S3 dengan biayaa sendiri maka dari itu cara saya untuk mewujudkannya dengan saya applay platform magang serta applay berbagai macam beasiswa\r\n- Lulus Cumlaude cara untuk mewujudkannya dengan memaksimalkan semua mata kuliah, belajar dengan giat, belajar inovatif, kuliah dengan sebenar-benarnya, serta berdoa\r\n- Mendapat pekerjaan yang layak sesuai dengan porsi kelayakan serta kemampuan diri, cara saya untuk mewujudkanya adalah dengan saya terus mengupgrade diri saya supaya mecapai kualitas terbaik dari diri saya.\r\n- Kuliah di Luar Negeri, mewujudkannya dengan terus mengupgrade diri, belajar giat belajar inovatif, mencari tahu tentang persyaratan kampus yang akan saya tuju dan berusaha memenuhi semua syarat itu, serta tidak lupa untuk mencari dan applay beasiswa luar negeri.',	'Selama SMA saya aktif di organisasi sekolah pada bidang ROHIS (Rohani Islam). saya sebagai bendahara di bidang tersebut dengan tugas menyusun rencana anggaran, melaksanakan pengelolaan keuangan dan pengadaan kebutuhan barang organisasi, dan memfasilitasi kebutuhan pembiayaan program kerja dan roda organisasi. tujuan saya ikut organisasi adalah selain melatih softskill dan leadship, juga sebagai ajang untuk berbagi ilmu yang sudah saya dapatkan dan sudah saya terapkan. selain itu juga ikut serta dalam kepanitiaan keagamaan dan berperan sebagai MC serta mengikuti kegiatan baksos (bakti sosial) yang diadakan oleh gabungan organisasi Osis, Rohis, PMR, Dewan Ambalan (Pramuka) dan memegang peran sebagai bendahara. ',	1,	1653674063,	NULL,	0),
('SCHLR-LTFTL-3e7a14',	'USR-LTFTL-30205',	'Latifatul Aisyah Nabila',	'2002-10-08',	'89637926575',	'Jl. Kh. Ahmad Dahlan, Rt 06/ Rw 10, No. 46, Gang Damai, Kelurahan Petir, Kecamaan Cipondoh, Kota Tangerang, Banten.',	'Fisika',	'Universitas Negeri Malang',	'3.65',	'2',	'Nama saya Latifatul Aisyah Nabila, saya adalah seorang mahasiswa dari jurusan Fisika di Universitas Negeri Malang. saya mengambil jurusan fisika karena saya suka dengan hal-hal yang menantang dan juga karena fisika merupakan ilmu yang mempelajari bagaimana alam semesta bekerja.\r\nsetelah menjalani 2 semester saya sudah lumayan banyak mendaftarkan diri mengikuti unit kegiatan mahasiswa, contohnya basket, saya sudah lama memang minat dengan olahraga satu ini, karena bermain basket merupakan salah satu hobby saya. lalu saya mengikuti organisasi relawan dan saya masuk dalam divisi kesehatan, saya mengikuti kegiatan ini karena memang saya sudah lama ingin mengikuti kegiatan-kegiatan kerelawanan. lalu saya mengikuti unit kegiatan mahasiswa penulis, saya mengikuti kegiatan tersebut karena saya ngen mengasah skill saya dalam menulis, karena sejak SMA saya sudah pernah mengikuti lomba karya ilmiah dan saya ingin melanjutkan hal tersebut di bangku perkuliahan.',	'impian saya begitu banyak, tapi satu hal yang sudah pasti saya harus wujudkan adalah saya ingin berguna untuk orang lain terutama menjadi kebanggan orang tua saya. cara saya mewujudkannya adalah memulai dengan hal-hal kecil, seperti membantu sesama sesuai dengan kemampuan saya.',	'iya, berawal dari organisasi di bangku SMA saya mengikuti organisasi KIR (Karya Ilmiah Remaja) disana saya mulai tertarik dalam menulis, saya memulai hal-hal kecil dengan mencoba-coba berbagai perlombaan, dan Alhamdulillah saya pernah menjadi juara 1 kelompok karya tulis Ilmiah bidang IPA.\r\nSelanjutnya dibangku perkuliahan saya juga sudah mengikuti berbagai organisasi yg pertama basket, saya sudah lama minat dengan olahraga satu ini, karena bermain basket merupakan salah satu hobby saya. lalu saya mengikuti organisasi relawan dan saya masuk dalam divisi kesehatan, saya mengikuti kegiatan ini karena memang saya sudah lama ingin mengikuti kegiatan-kegiatan kerelawanan. lalu saya mengikuti unit kegiatan mahasiswa penulis, saya mengikuti kegiatan tersebut karena saya ingin mengasah skill saya dalam menulis, karena sejak SMA saya sudah pernah mengikuti lomba karya ilmiah dan saya ingin melanjutkan hal tersebut di bangku perkuliahan.',	1,	1654526494,	NULL,	0),
('SCHLR-LTFTL-80f60e',	'USR-LTFTL-6e316',	'Latifatul Zahrah',	'2003-05-23',	'87778214806',	'jl.sultan kaharudin, lingkungan pesinggahan, pagesangan barat, MATARAM, NTB',	'pendidikan teknologi informasi',	'universitas pendidikan mandali',	'3.88',	'2',	'perkenalkan saya latifatul zahra biasa dipanggil zahra, umur saya saat ini memginjak usia 19 tahun, saya adalah seseorang yang memiliki banyak hobbi mulai dari olahraga, memasak, mendesaign,melukis, dan traveling. saya juga sangat suka dengan hal2 baru yang menantang bagi saya, ini semua karena rasa penasaran dan keingintahuan yang tinggi dalam diri saya sehingga saya terdorong dan merasa tertantang untuk melakukan hal baru tersebut. selain itu saya juga sangat suka pergaulan sosial yang berkualiatas dalam artian yang bisa diajak berkomunukasi dengan baik dan saling menghargai.',	'saya punya mimpi dimana mimpi ini sangat besar dan sangat membutuhkan proses yang besar pula,mimpi saya yaitu ingin menjadi motivator dan pengajar yang sangat berguna bagi semua orang dan membantu semua orang agar mendapatkan pendidikan yang memadai, dimana itu semua pasti membutuhkan ilmu pengetahuan dan pengalaman yang sangat luas. akan tetapi untuk mendapatkan ilmu pengetahuan dan pengalaman yang luas ini kan biasanya akan mengeluarkan biaya yang cukup besar sedangkan perekonomian saya tidak dapat mendukung itu. tapi saya tidak menyerah, malah saya mencari solusi lain seperti mengikuti beasiswa pendidikan seperti yang di adakan oleh ybb saat ini.',	'saya dulu waktu SMA pernah mengikuti organisasi osis walaupun saya hanya sebagai anggota saja, namun di organisasi itu saya mendapatkan banyak ilmu, seperti cara berkomunikasi yang baik,toleransi, selalu menjaga kerapian karena sebagai contoh untuk teman2 yang lain,dan juga saya pernah menjadi seseorang yang di tugaskan untuk menjadi divisi keamanan di acara ospek untuk siswa/i baru.',	1,	1654168154,	NULL,	0),
('SCHLR-LTHFC-72cb37',	'USR-LTHFC-5b3ce',	'Luthfia Cahya Az-Zahra',	'2003-05-25',	'81218269803',	'Perum griya pesona asri, kec. Klari, kab. Karawang',	'Akuntansi',	'UIN Malang',	'3.86',	'2',	'Saya adalah mahasiswi jurusan Akuntansi Universitas Islam Negeri Maulana Malik Ibrahim Malang. Saya memiliki minat di bidang bahasa dan kepenulisan. Meskipun minat dan bakat saya di bidang bahasa dan kepenulisan, saya juga ingin mempelajari bagaimana mengatur keuangan dengan baik karena keuangan sangat berhubungan dengan laju pergerakan perekonomian baik diri sendiri, keluarga, masyarakat, dan negara. Saya merupakan mahasiswi aktif dengan mengikuti organisasi dan olimpiade akademik. ',	'Mimpi terbesar saya adalah bisa berkontribusi dalam laju pergerakan perekonomian nasional dengan menyumbangkan pemikiran dan teori yang ditulis dalam sebuah karya buku mengenai teori pemikiran perekonomian saya sendiri. Cara saya menggapai impian saya adalah dengan belajar dengan giat menekuni bidang perekonomian dan keuangan serta membaca teori-teori tokoh ekonomi klasik dan modern serta memulai bisnis kecil dan mulai menabung untuk mengatur keuangan. Saya mulai dari diri saya sendiri dan usaha saya itu saya yakini bahwa saya akan berhasil untuk mewujudkan perekonomian yang sejahtera di masa depan. ',	'Saya memiliki pengalaman organisasi di resimen mahasiswa. Saya berkontribusi menjadi panitia acara kursus pelatihan peningkatan mental dan spritual lingkup resimen mahasiswa se-nasional. Kemudian saya menjadi bagian dari Himpunan Mahasiswa Jurusan Akuntansi (HMJA) UIN Malang di divisi enterpreneur. Saya berkontribusi untuk meningkatkan pemasukan kas organisasi dan membantu usaha atau bisnis dari teman-teman akuntansi UIN Malang. Saya juga berorganisasi di komunitas pembangun akuntansi. Di komunitas ini saya belajar banyak hal mengenai akuntansi, ekonomi, dan bisnis sehingga bisa saya terapkan di kehidupan bermasyarakat nanti ketika saya terjun ke masyarakat. ',	1,	1655251892,	NULL,	0),
('SCHLR-LTHFN-0c207d',	'USR-LTHFN-f5d3b',	'Luthfi Nabilah Ailen',	'2004-07-12',	'88210978832',	'Jalan Bengawan No.37 Rt07/Rw01 Cideng Barat, Gambir, Jakarta Pusat ',	'Hukum',	'Universitas Jenderal Soedirman',	'3.50',	'0',	'Saya merupakan seorang anak perempuan sekaligus anak pertama dari dua bersaudara. Saya lahir di Banyumas, 12 Juli 2004. Tahun ini, bulan Mei saya baru saja lulus dari SMA. Bulan Maret lalu, saya diterima di Universitas Jenderal Soedirman jurusan Hukum jalur SNMPTN, saya amat senang dengan pencapaian ini, tetapi saya sadar masih banyak yang harus saya lakukan nanti ketika kuliah. Saya sangat suka belajar hal-hal baru karena menurut saya itu adalah sesuatu yang menarik, saya juga suka bersosialisasi dengan orang banyak tetapi terkadang saya agak malu untuk memulainya terlebih dulu karena saya sendiri merupakan tipe orang ambivert. Saya orangnya tidak bisa hanya diam diam saja, gampang merasa bosan ketika tidak memiliki hal yang bisa dikerjakan, saya lebih suka berinteraksi/beraktivitas di luar rumah. Selain itu, saya adalah orang yang harus sempurna dalam artian, jika saya mengerjakan segala sesuatu harus berhasil, harus bagus, dan harus baik. Kalau itu belum bisa terwujud, maka saya akan mencobanya terus. Salah satu tujuan hidup saya ialah bisa mendapatkan beasiswa untuk kuliah, maka dari itu saya mencoba kesempatan ini.',	'Mimpi terbesar saya ialah membahagiakan orang tua, meraih beasiswa untuk meringankan biaya kuliah, dan menjadi hakim di masa yang datang. Untuk menjadi hakim, tentunya saya berkuliah di jurusan hukum terlebih dahulu, di sini saya akan terus belajar dengan baik agar mendapatkan hasil yang memuaskan sesuai keinginan saya, dengan cara inilah yang saat ini saya lakukan untuk menjadi seorang hakim nantinya. Dengan menjadi seorang hakim yang sukses, saya akan membahagiakan orang tua dengan prestasi-prestasi yang (insya Allah) akan saya dapatkan. Untuk sekarang, saya membahagiakan orang tua dengan cara nurut dan selalu mendengarkan nasihat-nasihatnya, setidaknya saya sudah bisa membuat orang tua senang dengan menjadi anak yang baik dalam bertingkah laku. Dan mendaftar beasiswa ini adalah cara saya meraih beasiswa agar meringankan biaya saya ketika kuliah, dengan mendapatkan beasiswa juga membuat orang tua bangga pada saya.',	'Semasa SMA, saya bergabung dalam organisasi tari ratoh jaroe dan OSIS. Dikedua organisasi itu saya menerapkan bagaimana cara bekerja dalam tim yang baik dan problem solving yang baik dalam tim. Pertama, ketika saya bergabung dalam OSIS, banyak hal yang saya lakukan di sana. Mulai dari membuat program, menjalankan program saya sendiri, dan membantu menjalankan program teman yang lain. Salah satu program yang saya buat ialah bakti sosial. Di sana saya bersama teman-teman menggalakan dana untuk membeli makanan berbuka puasa dan diberikan kepada orang orang di masjid, para tukang ojek, anak anak dan orang-orang kurang mampu di jalanan. Saya sangat senang melakukan hal tersebut karena berbagi adalah sesuatu yang saya sukai, dengan berbagi kepada mereka yang membutuhkan dapat menimbulkan kesenangan bagi mereka dan juga diri saya sendiri. Dari SMP, saya sudah bergabung dengan OSIS untuk melakukan banyak kegiatan dan mendapat pengalaman di dalamnya. Ya, saya sangat suka hal tersebut, bersosialisasi, berinteraksi, dan beraktivitas bersama dengan baik dan penuh kegembiraan meskipun di dalamnya pasti terdapat kendala. Kedua, tari ratoh jaroe adalah salah satu hobi yang saya senangi. Dari SMP juga saya sudah ikut bergabung di dalamnya. Awalnya, saya mengikuti organisasi ini karena demo ekskul dan saya tertarik dengan gerakannya yang unik maka dari itu saya ingin mencoba mempelajarinya, siapa sangka bahwa saya ternyata menyukai tari ratoh jaroe ini dan kemudian saya lanjutkan ketika SMA. Tari ini sangat membutuhkan kerja sama dan kekompakan tim agar bisa menjadi suatu tarian yang padu dan indah, jika satu orang salah, maka akan membuat tarian menjadi tidak sempurna juga tidak enak untuk dilihat. Selama saya bergabung, saya pernah mengikuti lomba sebanyak 3x. Dari ketiganya itu, saya dan tim belum pernah mendapat juara. Tapi itu bukan alasan untuk saya berhenti dari kegiatan ini. Pencapaian itu bisa diraih dalam banyak hal, bukan dari sini saja. Meskipun memang sedih, tapi saya sudah berhasil mempelajari dan mempraktikkan gerakan tari tersebut dengan baik, bahkan saya bisa mengajar adik adik kelas melakukan tari tersebut, itu membuat saya senang.',	1,	1655703245,	NULL,	0),
('SCHLR-LVNFL-a636ca',	'USR-LVNFL-e317f',	'Levani Florencia Putri Zebua',	'2004-04-25',	'89624609404',	'levaniflorencia@gmail.com',	'Ilmu Hukum/Hukum',	'SMA AISYIYAH 1 PALEMBANG/UNIVE',	'3.98',	'1',	'Hai perkenalkan nama saya levani florencia putri zebua, di panggil puput beda banget yah dari nama pjg saya hehe. Saya memiliki sifat sedikit pemalu tapi kalo udah lebih kenal saya pasti beda dari yg awal dulu kenal hehe. Saya memiliki keluarga yang sederhana dan saya anak ke 2 dari 5 bersaudara saya sangat bahagia dengan keluarga saya tersebut kami selalu bercerita bercanda bersama, semenjak saya SMA saya menjadi anak yang rajin di sekolah, karena belajar dari pengalaman SMP yaitu saya sangat malas untuk belajar, dari yang dulu saya tidak pernah masuk 10 besar semenjak SMA selalu masuk 5 besar, dan alhamdulillah saya di Terima di Universitas Sriwijaya jalur masuk SNMPTN, awal nya saya tidak menyangka saya lulus di universitas tersebut hampir saya tolak jalur tersebut di karenakan ekonomi keluarga yg sangat kurang,tapi orang tua saya menyuruh mengambil nya dgn mengatakan itu sudah takdir saya,dan berkat dukungan orang tua dan temen temen saya, akhirnya saya bertekad ingin kuliah dan bisa menggapai cita cita saya menjadi seorang advokat/pengacara, smga saya bisa mendapat beasiswa ini agar bisa melanjutkan kuliah saya amin-!!',	'Saya bercita-cita ingin menjadi advokat/pengacara, dengan itu saya mengambil jurusan hukum dan saya akan bersungguh-sungguh akan meraih mimpi tersebut dan buat orang tua saya bangga atas keberhasilan saya.',	'Di sekolah saya terdapat tahfidz juz 30, alhamdulillah sebelum wisuda saya berhasil menyelesaikan juz 30 saya, dan wisuda bersama tahfidz yang lain',	1,	1655003363,	NULL,	0),
('SCHLR-LVNRM-15d7d2',	'USR-LVNRM-66194',	'Alvina Armelia',	'2002-09-27',	'81276048084',	'Jln Sekolah RT 03 RW 05 Dusun II Keramat Sakti Desa Kubang Jaya',	'Pendidikan Guru Sekolah Dasar ',	'Universitas Riau',	'3.85',	'2',	'Nama saya Alvina Armelia. Saya lahir tanggal 27 September 2002. Saya berasal dari keluarga yang sederhana. Saya anak kedua dari 4 bersaudara. Dan saat ini saya sedang melanjutkan pendidikan di Universitas Riau dengan Program Studi S1 Pendidikan Guru Sekolah Dasar.',	'Menjadi seorang guru adalah cita-cita saya dari masa saya duduk di Sekolah Dasar. Guru merupakan sosok inspiratif dan memberikan banyak wawasan yang luas. Oleh kerena itu saya minat saya di Dunia Pendidikan sangat tinggi. Pada saat duduk di bangku SMA saya mengikuti SNMPTN, dan mengambil program studi yang saya impikan, namun saya belum diterima melalui jalur tersebut. \r\nNamun itu tidak membuat saya patah semangat. Dan di kesempatan lain saya mencoba mendaftar SBMPTN dengan pilihan Program Studi yang sama saat pemilihan SNMPTN. Saya belajar dengan sungguh-sungguh untuk mencapai impian saya menjadi seorang guru. Karena saya dengan pepatah “Banyak jalan menuju roma” oleh karena itu saya tidak berputus asa untuk mencapai impian impian dan untuk menjadi orang yang bermanfaat bagi orang-orang disekitar saya. ',	'Iya, Saya aktif dalam beberapa organisasi, saat saya masih duduk di bangku SMA, saya aktif di Organisasi MPK. Ketika memasuki dunia perkuliahan saya mengikuti beberapa organisasi, Saat ini saya aktif dalam Organisasi Hima Prodi PGSD FKIP Universitas Riau, selain itu saya juga mengikuti Organisasi Koperasi Mahasiswa Universitas Riau disana saya belajar mengenai enterpreneur, dan juga Saya aktif dalam Organisasi FKIP LSO LSI Al-Maidan Universitas Riau\r\n\r\nMelalui organisasi yang saya ikuti, saya banyak mendapatkan ilmu baru serta menjalin relasi yang luas. Besar harapan saya bisa menjadi salah satu Penerima Beasiswa Youth Break the Boundaries dan dapat mengikuti kegiatan, event yang akan di adakan oleh Program YBB scholarship.',	1,	1654439173,	NULL,	0),
('SCHLR-LWPDL-71746f',	'USR-LWPDL-3e1fb',	'Alwi Padly Harahap',	'2000-06-16',	'82267157243',	'Dusun Bakti Padangrie Desa Simatahari Kecamatan Kota Pinang Kabupaten Labuhan Batu Selatan Propinsi Sumatera Utara',	'Ilmu Hadits/Ushuluddin dan Stu',	'Universitas Islam Negeri Sumat',	'3.80',	'6',	'Saya seorang mahasiswa yang hoby membaca serta haus dengan ilmu pengetahuan.',	'Membuka suatu perusahaan yang menerima lapangan pekerjaan, mungkin dengan mengikuti program beasiswa ini merupakan jalan saya menimbah ilmu bagaimana cara kinerja menciptakan lapangan pekerjaan.',	'Iya, saya pernah mengikuti organisasi didaerah kota tempat saya tinggal, organisasi tersebut bertujuan untuk merangkul para pemuda yang putus asa menghadapi masa depan.',	1,	1654364721,	NULL,	0),
('SCHLR-LXNDR-5667aa',	'USR-LXNDR-7c276',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655447385,	NULL,	0),
('SCHLR-LXNDR-a6e9ea',	'USR-LXNDR-ee479',	'Alexandra Amadea Pingkan Putri Dewinta',	'2003-11-02',	'85741241170',	'Jalan Werkudara no.2 Wirobrajan, Yogyakarta',	'Manajemen',	'Universitas Pembangunan Nasion',	'3.78',	'2',	'Perkenalkan, saya Alexandra Amadea Pingkan Putri Dewinta, saya adalah mahasiswa aktif semester 2 program studi Manajemen UPN \"Veteran\" Yogyakarta. Saya adalah anak ke 2 dari 3 bersaudara, dan saya berasal dari keluarga dengan kondisi ekonomi menengah. Namun, saat ini beban ekonomi keluarga saya sedikit lebih berat dari sebelumnya, karena ayah saya merupakan pegawai swasta yang gajinya bergantung pada beberapa faktor sehingga memperoleh gaji tidak tetap. Oleh sebab itu, salah satu alasan saya mendaftarkan diri untuk program beasiswa ini guna meringankan beban orang tua saya. Disamping itu, alasan saya mendaftarkan diri beasiswa ini adalah ingin mengembangkan diri sebagai seseorang yang berkarakter unggul dan dapat memberikan kontribusi bagi lingkungan sekitar saya.\r\nMungkin perjalanan pendidikan saya tidaklah seluar biasa orang-orang diluar sana yang unggul dalam prestasi ataupun memiliki keahlian di bidang khusus. Namun, saya merupakan orang yang gigih, pekerja keras, dan memiliki kemauan untuk mempelajari hal baru. Dan untuk saat ini, kesibukan saya adalah mengikuti kegiatan perkuliahan, organisasi di bangku perkuliahan dan sosial kemasyarakatan (Karang Taruna), dan kadang kala membantu pekerjaan ibu saya. Beliau saat ini bekerja sebagai seorang penjahit dan pembuat kerajian tangan.',	'Saya memiliki minat yang besar untuk menjadi pengusaha. Saat ini saya sedang mencoba mengasah kemampuan saya di bidang tersebut melalui organisasi yang saya ikuti. Di samping itu, saya juga memiliki usaha yang sempat saya rintis bersama kakak saya. Namun, saat ini usaha tersebut sedang kami hentikan untuk sementara, karena perbedaan wilayah dan kami sedang fokus pada kesibukan kami masing-masing.',	'Ya, saat ini saya sedang aktif mengikuti organisasi Himpunan Mahasiswa Program Studi Manajemen (HUMMAN) UPN \"Veteran\" Yogyakarta. Pada organisasi HUMMAN saat ini, saya menjabat sebagai staff divisi ekonomi kreatif. Pada divisi ekonomi kreatif saya dipercaya menjadi wakil kepala pelaksana program kerja HUMMAN Shop oleh kepala divisi ekonomi kreatif. Sebagai wakil kepala pelaksana program kerja divisi ekonomi kreatif, saya diberi tanggung jawab untuk menghimpun dana yang nantinya akan digunakan untuk menopang program kerja himpunan dan memenuhi kebutuhan mahasiswa manajemen maupun mahasiswa baru manajemen. Dan untuk di organisasi Karang Taruna, saya menjabat sebagai anggota. Di organisasi tersebut, saya aktif mengikuti workshop sampai dengan penyuluhan yang diberikan.',	1,	1655469279,	NULL,	0),
('SCHLR-LXNDR-fbb53e',	'USR-LXNDR-7c276',	'Alexandra Amadea Pingkan Putri Dewinta',	'2003-11-02',	'85741241170',	'Jalan Werkudara no.2 Wirobrajan, Yogyakarta',	'Manajemen',	'Universitas Pembangunan Nasion',	'3.78',	'2',	'Perkenalkan, saya Alexandra Amadea Pingkan Putri Dewinta, saya adalah mahasiswa aktif semester 2 program studi Manajemen UPN \"Veteran\" Yogyakarta. Saya adalah anak ke 2 dari 3 bersaudara, dan saya berasal dari keluarga dengan kondisi ekonomi menengah. Namun, saat ini beban ekonomi keluarga saya sedikit lebih berat dari sebelumnya, karena ayah saya merupakan pegawai swasta yang gajinya bergantung pada beberapa faktor sehingga memperoleh gaji tidak tetap. Oleh sebab itu, salah satu alasan saya mendaftarkan diri untuk program beasiswa ini guna meringankan beban orang tua saya. Disamping itu, alasan saya mendaftarkan diri beasiswa ini adalah ingin mengembangkan diri sebagai seseorang yang berkarakter unggul dan dapat memberikan kontribusi bagi lingkungan sekitar saya.\r\nMungkin perjalanan pendidikan saya tidaklah seluar biasa orang-orang diluar sana yang unggul dalam prestasi ataupun memiliki keahlian di bidang khusus. Namun, saya merupakan orang yang gigih, pekerja keras, dan memiliki kemauan untuk mempelajari hal baru. Dan untuk saat ini, kesibukan saya adalah mengikuti kegiatan perkuliahan, organisasi di bangku perkuliahan dan sosial kemasyarakatan (Karang Taruna), dan kadang kala membantu pekerjaan ibu saya. Beliau saat ini bekerja sebagai seorang penjahit dan pembuat kerajian tangan.',	'Saya memiliki minat yang besar untuk menjadi pengusaha. Saat ini saya sedang mencoba mengasah kemampuan saya di bidang tersebut melalui organisasi yang saya ikuti. Di samping itu, saya juga memiliki usaha yang sempat saya rintis bersama kakak saya. Namun, saat ini usaha tersebut sedang kami hentikan untuk sementara, karena perbedaan wilayah dan kami sedang fokus pada kesibukan kami masing-masing.',	'Ya, saat ini saya sedang aktif mengikuti organisasi Himpunan Mahasiswa Program Studi Manajemen (HUMMAN) UPN \"Veteran\" Yogyakarta. Pada organisasi HUMMAN saat ini, saya menjabat sebagai staff divisi ekonomi kreatif. Pada divisi ekonomi kreatif saya dipercaya menjadi wakil kepala pelaksana program kerja HUMMAN Shop oleh kepala divisi ekonomi kreatif. Sebagai wakil kepala pelaksana program kerja divisi ekonomi kreatif, saya diberi tanggung jawab untuk menghimpun dana yang nantinya akan digunakan untuk menopang program kerja himpunan dan memenuhi kebutuhan mahasiswa manajemen maupun mahasiswa baru manajemen. Dan untuk di organisasi Karang Taruna, saya menjabat sebagai anggota. Di organisasi tersebut, saya aktif mengikuti workshop kewirausahaan sampai dengan penyuluhan dan pelatihan yang diberikan.',	1,	1655447594,	NULL,	0),
('SCHLR-LYDYH-314fdc',	'USR-LYDYH-42a8a',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655114472,	NULL,	0),
('SCHLR-LYFYN-1f0d4e',	'USR-LYFYN-8d9f7',	'Lyfeyeni Ramadhan br. Sembiring',	'2002-11-14',	'81378464802',	'Medan, Sumatera Utara',	'Pendidikan bahasa Jerman/ Pend',	'Universitas Negeri Medan',	'0.00',	'4',	'Saya Lyfeyeni, ahli dalam bidang illustrator, namun masih belum memiliki bentuk prestasi apapun, berkuliah di unimed, dengan jurusan bahasa Jerman karena berminat dan ingin menjadi seorang tour guide',	'Saya ingin menjadi seorang tour guide yang ahli dalam menggambar dan membuat suatu hal yang berguna, saya akan mewujudkannya dengan pelan pelan dimulai dengan mempelajari bahasa asing terlebih dahulu, sambil memperbaiki gambar yang masih terbilang kurang bagus. ',	'Ya, di sekolah semasa SMA saya mengikuti organisasi IPM, yang di dalamnya terbagi menjadi beberapa lembaga, dan saya salahsatunya terpilih sebagai sekreataris dari lembaga protokuler yaitu yang berkaitan dengan seni, dan saya serta tim saya juga menjadi koordinator untuk setiap acara selama satu tahun lebih.',	1,	1654051964,	NULL,	0),
('SCHLR-LYGDS-3e2f42',	'USR-LYGDS-f4c9e',	'Alya Gadis Aqilah',	'2004-03-31',	'81374295290',	'Puri Legenda Blok B1 No. 12A, Batam, Kepulauan Riau',	'Ilmu Kesehatan Masyarakat',	'Universitas Sriwijaya',	'4.00',	'2',	'Saya merupakan orang yang jujur dan bertanggung jawab dengan apa yang saya lakukan. Saya menjunjung tinggi 3 value diantaranya honesty, responsibility, dan trust. Jika saya diberikan kepercayaan saya akan bekerja keras untuk memegang kepercayaan itu agar tidak mengecewakan orang lain. Sesuai dengan jurusan kuliah saya, saya memiliki interest tinggi terhadap bidang kesehatan, saya senang bertemu dengan orang baru serta orang banyak. Bertemu dengan orang baru membuat saya mengetahui banyak hal serta bisa berpikir dari segala sudut pandang. Selain itu, saya juga senang berbicara di depan umum, walaupun masih suka nervous, saya tetap mengambil opportunity ini jika ada kesempatan, sebagai tempat berlatih public speaking.',	'Sejauh ini, mimpi terbesar saya diantaranya adalah kuliah s2 di luar negeri dan bekerja di headquarter WHO. Saya selalu terkesima melihat pekerja WHO terjun langsung ke lapangan membantu para masyarakat meningkatkan kesehatan, pergi ke pelosok-pelosok daerah. Kuliah ke s2 ke luar negeri menjadi langkah penting yang harus dilakukan untuk saya bisa bekerja di tempat impian saya tersebut. Hal yang saya lakukan sekarang sebagai langkah untuk mewujudkannya antara lain bekerja keras dan tekun dalam kuliah, benar-benar memahami materinya, serta melakukan pengembangan diri melalui organisasi seperti English skill, public speaking, serta kepercayaan diri. Hal lain yang ingin saya lakukan untuk mewujudkan impian tersebut adalah dengan mendapatkan beasiswa kuliah dalam dan luar negeri, melakukan student exchange ke luar negeri, serta melakukan volunteering ke pelosok daerah agar mengetahui kondisi kesehatan di lapangan secara nyata.',	'Ya, selama kuliah saya mengikuti dua organisasi yaitu BO English and Study Club FKM Unsri, serta AIESEC in Unsri. Belum sampai setahun saya berada di dua organisasi ini, tapi saya merasa sudah merasakan dampak yg diberikan. di BO ESC, saat ini saya menjabat sebagai Manager di departemen English Quality, disini saya diharuskan untuk menyelenggarakan lomba debat tingkat fakultas, english class, serta program kerja lainnya. Disini saya belajar bagaimana menjadi seorang leader, saya dituntut untuk bisa membagi waktu, membagi pekerjaan kepada anggota tim, memikirkan solusi, dan masih banyak lagi. Sedangkan di AIESEC in Unsri, saya merupakan staff dari Talent Capacity and LnD of Talent Management. Disini saya bertanggung jawab melakukan recruitment, sehingga saya sering melakukan interview baik untuk staff atau pun organizing comittee, saya dituntut untuk memiliki communication skill yang baik, selain itu, saya juga bertanggung jawab melakukan education, yang dimana sejauh ini saya banyak membuat konten konten edukasi yang nantinya akan di upload di intercomm kami. Untuk relawan sendiri, sampai saat ini saya belum pernah mengikutinya, saya coba mendaftar di beberapa platform untuk mengikuti relawan ke luar kota, tapi sejauh ini gagal, sehingga saya terus mencobanya, dan saat ini sedang dalam proses seleksi.',	1,	1655579038,	NULL,	0),
('SCHLR-LYKHR-667735',	'USR-LYKHR-cf9a9',	'Ulya Khoirunnisa',	'2004-02-27',	'85928051973',	'Paok Motong kecamatan Masbagik Kabupaten Lombok Timur Provinsi Nusa Tenggara Barat Pulau Lombok',	'IPS / Desain Komunikasi Visual',	'Man Insan Cendekia Lombok Timu',	'0.00',	'1',	'Halo! Nama saya Ulya Khoirunnisa. Alamat saya Paokmotong, Lombok Timur NTB. Saat ini status sebagai mahasiswa baru di Universitas Sebelas Maret jurusan Desain Komunikasi Visual. Pengalaman saya terkait hal ini Bermulai sejak pandemi, dimana saya mulai mempertanyakan banyak hal pada diri saya sendiri, apa yang saya suka/tidak suka, ingin jadi seperti apa saya kelak, bagaimana meraihnya? Menggali dalam diri dan mulai mengenal diri lebih baik, hingga mendapat sebuah jawaban. Saya takjub dan begitu tertarik, seakan mimpi dulu semasa kecil mulai kembali terbangun, jadi saya ingin mempelajari lebih dalam tentang bidang ini, saya pun mulai melatih diri dari apa yang sering saya lihat, sepert ide yang berasal dari hobi mulai bisa saya tuangkan dalam bentuk gambar, hingga sekarang mulai berkembang dan saya yakin akan terus berkembang dengan jalannya waktu. Kesibukan saya saat ini, saya berusaha mengasah skill dalam diri dan hal yang pasti akan diperlukan untuk menghadapi di masa depan, seperti bahasa Inggris, mencari tahu seputar jurusan dan belajar sedikit sedikit pelajarannya, pelan pelan belajar menjual kue kukus kepada keluarga besar, melihat informasi terbaru terkini yang ada di media sosial, tugas rumah yang dipesan oleh orang tua sebelum kerja, dan healing di malam hari dengan bermain game open world yang begitu menginspirasi bagi saya.',	'Mimpi terbesar saya adalah membahagiakan orang tua, dimana disini cara saya mewujudkannya ialah belajar sungguh sungguh, menjadi orang yang sukses dan dapat membanggakan mereka kelak. Berguna bagi masyarakat sekitar dan berguna untuk nusa dan bangsa, dapat ikut berpartisipasi aktif dalam mewujudkan Indonesia maju generasi emas di masa depan.',	'Ya, saya pernah punya pengalaman organisasi sewaktu sekolah dulu- Di Man Insan Cendekia Lombok Timur, dimana sekolahnya merupakan wajib asrama 3 tahun. Disana saya mengikuti organisasi PMR (palang merah remaja) dan organisasi wajib Pramuka. Di kedua organisasi tersebut, hal yang benar benar saya rasakan impact nya ke diri saya adalah, kekeluargaan, kepedulian, ketahanan, dan kepemimpinan. Saat itu saya- kami, angkatan 3 baru menapakkan kaki disana, kelas 10 kesan akan \"beginilah IC\" begitu tertanam dalam diri kami sebagai bibit baru disana, mental kami dilatih. Menjadi relawan? Tentu pernah, Semua saling tolong menolong agar kegiatan berhasil dan sukses.',	1,	1654271723,	NULL,	0),
('SCHLR-LYKHR-f4b765',	'USR-LYKHR-cf9a9',	'Ulya Khoirunnisa',	'2004-02-27',	'85928051973',	'Paok Motong kecamatan Masbagik Kabupaten Lombok Timur Provinsi Nusa Tenggara Barat Pulau Lombok',	'IPS / Desain Komunikasi Visual',	'Man Insan Cendekia Lombok Timu',	'0.00',	'1',	'Halo! Nama saya Ulya Khoirunnisa. Alamat saya Paokmotong, Lombok Timur NTB. Saat ini status sebagai mahasiswa baru di Universitas Sebelas Maret jurusan Desain Komunikasi Visual. Pengalaman saya terkait hal ini Bermulai sejak pandemi, dimana saya mulai mempertanyakan banyak hal pada diri saya sendiri, apa yang saya suka/tidak suka, ingin jadi seperti apa saya kelak, bagaimana meraihnya? Menggali dalam diri dan mulai mengenal diri lebih baik, hingga mendapat sebuah jawaban. Saya takjub dan begitu tertarik, seakan mimpi dulu semasa kecil mulai kembali terbangun, jadi saya ingin mempelajari lebih dalam tentang bidang ini, saya pun mulai melatih diri dari apa yang sering saya lihat, sepert ide yang berasal dari hobi mulai bisa saya tuangkan dalam bentuk gambar, hingga sekarang mulai berkembang dan saya yakin akan terus berkembang dengan jalannya waktu. Kesibukan saya saat ini, saya berusaha mengasah skill dalam diri dan hal yang pasti akan diperlukan untuk menghadapi di masa depan, seperti bahasa Inggris, mencari tahu seputar jurusan dan belajar sedikit sedikit pelajarannya, pelan pelan belajar menjual kue kukus kepada keluarga besar, melihat informasi terbaru terkini yang ada di media sosial, tugas rumah yang dipesan oleh orang tua sebelum kerja, dan healing di malam hari dengan bermain game open world yang begitu menginspirasi bagi saya.',	'Mimpi terbesar saya adalah membahagiakan orang tua, dimana disini cara saya mewujudkannya ialah belajar sungguh sungguh, menjadi orang yang sukses dan dapat membanggakan mereka kelak. Berguna bagi masyarakat sekitar dan berguna untuk nusa dan bangsa, dapat ikut berpartisipasi aktif dalam mewujudkan Indonesia maju generasi emas di masa depan.',	'Ya, saya pernah punya pengalaman organisasi sewaktu sekolah dulu- Di Man Insan Cendekia Lombok Timur, dimana sekolahnya merupakan wajib asrama 3 tahun. Disana saya mengikuti organisasi PMR (palang merah remaja) dan organisasi wajib Pramuka. Di kedua organisasi tersebut, hal yang benar benar saya rasakan impact nya ke diri saya adalah, kekeluargaan, kepedulian, ketahanan, dan kepemimpinan. Saat itu saya- kami, angkatan 3 baru menapakkan kaki disana, kelas 10 kesan akan \"beginilah IC\" begitu tertanam dalam diri kami sebagai bibit baru disana, mental kami dilatih. Menjadi relawan? Tentu pernah, Semua saling tolong menolong agar kegiatan berhasil dan sukses.',	1,	1654271780,	NULL,	0),
('SCHLR-LYSKH-27f8d9',	'USR-LYSKH-1af07',	'Ilyas Khoirudin',	'2002-06-11',	'85716483895',	'Gg. madrasah Rt 07/01 Rawajati Pancoran',	'Bisnis digital Fakultas Ekonom',	'Universitas Padjadjaran',	'3.54',	'2',	'Saya tahun ini memasuki usia yang ke-20.\r\nBerada di titik ini saya bersyukur saya telah berhasil melalui beberapa fase kehidupan sebelum nya hingga saya ada di titik ini. Saya adalah anak kedua dari tiga bersaudara. Saya berasal dari keluarga yang sederhana. Kondisi saya yang terbatas sering kali menjadi motivasi saya untuk berusaha menjadi yang terbaik dari setiap apa yang lakukan. Saya seorang yang pekerja keras, konsisten, loyal, dan rendah hati. Alhamdulillah saya merasa saya mendapatkan akses pendidikan yang baik sejak SD. Yang kemudian saya berkesempatan melanjutkan di smp dan sma negeri terbaik di wilayah tersebut. Saya memiliki minat di bidang pendidikan dan bisnis, khususnya di bidang pengembangan diri. Saya juga banyak mendapatkan ilmu dan pengetahuan diluar dari pendidikan formal. Karena ilmu kehidupan itu masih sangat luas dibandingkan yang ada di sekolah.',	'Mimpi terbesar saya dalam hidup ini adalah memberikan manfaat kepada orang lain di sekitar saya. Dalam hal ini saya ingin membangun sebuah lembaga pendidikan non formal sekaligus menyediakan program beasiswa. Cara saya yang tempuh adalah mencoba aktif dari sekarang dalam berbagai kegiatan, seperti organisasi dan kepanitiaan. Hal ini untuk mengasah skill dan pengalaman saya. Selain itu juga, saya tetap harus fokus menyelesaikan studi kuliah saya. Cara saya mewujudkannya adalah saya berkomitmen kepada diri saya sendiri bahwa saya harus menghidupkan mimpi tersebut suatu saat nanti. ',	'Dulu saat SMA saya aktif sebagai anggota OSIS. Itulah waktu pertama kali saya terjun ke dunia organisasi walaupun masih tingkat sekolah. Saya berada di divisi kerohanian. Saya cukup banyak mengikuti berbagai kepanitiaan saat itu, mulai dari program internal maupun program eksternal sekolah. Saya banyak mendapat insight dan pengalaman baru serta teman-teman baru. Hal ini yang meyakinkan saya untuk ikut kembali organisasi di kampus. Saat ini saya sedang ikut 2 organisasi dan 1 program volunteer.',	1,	1655720855,	NULL,	0),
('SCHLR-LYYNS-a8767e',	'USR-LYYNS-cbd73',	'Layyina Sharikha',	'2004-06-16',	'82391539386',	'Jalan perdagangan, Kampung Bandar, Kecamatan Senapelan, Kota Pekanbaru, Provinsi Riau',	'Psikologi ',	'Universitas Diponegoro ',	'0',	'1',	'Layyina adalah seorang mahasiswa baru yang baru saja lulus dari sekolah menengah atas. Sejak menduduki bangku SMA, Layyina telah menunjukkan performa yang baik di bidang akademik dan non akademik. Hal itu ditunjukkan dari berbagai pencapaian dan pengalaman yang dapat meningkatkan kemampuan akademik, komunikasi, dan sosial Layyina. ',	'Mimpi terbesar saya adalah dapat membuka lapangan pekerjaan bagi orang lain. Cara saya mewujudkannya adalah dengan belajar, mencoba, dan bekerja dengan giat.',	'Iya, saat SMA, saya pernah bergabung di 2 organisasi, yaitu PASKIBRA dan english school debate, sedangkan saat menjadi mahasiswa baru, saya sedang menjalani kegiatan sebagai volunteer di dua organisasi, yaitu Teman Ambiss dan Literasi Psikologi Indonesia. Di organisasi Teman Ambiss, saya bergabung ke divisi HRD dan di organisasi Literasi Psikologi Indonesia, saya bergabung ke divisi Public Relation. Berdasarkan pengalaman organisasi yang telah saya dapatkan saat SMA dan pengalaman yang sedang saya jalani saat menjadi mahasiswa baru, saya belajar banyak mengenai kerjasama dalam sebuah tim, pentingnya kepercayaan diri saat tampil di depan banyak orang, pentingnya keberanian dalam melakukan sesuatu, dan pentingnya komunikasi dalam sebuah kerjasama tim ',	1,	1655606817,	NULL,	0),
('SCHLR-LZMT-03b238',	'USR-LZMT-901270',	'Liza Mutia',	'2005-03-11',	'85244237574',	'Dusun Tamiang, Desa Alur Cucur, Kab. Aceh Tamiang, Prov. ACEH',	'Sastra Jepang (FIB)',	'Universitas Sumatera Utara',	'0.00',	'1',	'Saya mahasiswa baru sastra jepang yang bercita cita ingin menginjakkan kaki di Negara Sakura hanya saja orang tua saya membutuhkan bantuan dana agar mampu membiayai pendidikan saya hingga wisuda.',	'Ingin mengunjungi Negara Jepang dengan cara kuliah dengan prodi sastra jepang kemudian mecari peluang agar saya bisa mewujudkan impian saya',	'Ya, saya pernah mengikuti OSIS di SMA saya selama 3 tahun, disana saya mendapat banyak pengalaman baru, diantaranya menggalang dana, membantu persiapan acara besar yang di adakan disekolah, dan lainnya.',	1,	1654016679,	NULL,	0),
('SCHLR-MCHLM-4980c0',	'USR-MCHLM-3fe2d',	'michele amanda aprilyanti aritonang',	'2003-04-05',	'82259316586',	'Sumatera Utara desa pargaulan, kec. lintongnihuta, kab. humbang hasundutan',	'FISIKA FMIPA',	'UNIVERSITAS NEGERI MALANG',	'3.65',	'2',	'Saya Michele Amanda Aprilyanti Aritonang, saya seorang mahasiswa yang sedang menempuh pendidikan saya di universitas negeri malang dengan jurusan fisika. saya berasal dari sumatera utara, kedua orang tua saya petani dan saya memiliki 2 saudara. saya memiliki hobby bernyanyi dan membaca, saya juga sangat suka dengan hal hal baru seperti melakukan riset pada suatu hal. karena kesukaan saya melakukan riset, saya sekarang mengikuti sebuat organisasi riset di kampus. nama organisasi tersebut yaitu USRC ( UNMANNED SYSTEM RESEARCH CENTER ) yang melakukan riset untuk pesawat nirawak seperti drone. saya  bertanggung jawab, dan memiliki solve problem yang baik dikarenakan sedari kecil saya sudah dilatih untuk mandiri dan dapat menyelesaikan masalah saya sendiri. dalam perkuliahan saya juga, saya cukup aktif dan memiliki nilai yang baik dalam pelajaran saya. saya rasa demikian cerita tentang saya, saya ucapkan terimakasih.',	'saya ingin menjadi peneliti atau penemu yang suatu saat akan dikenal banyak orang. saya akan mewujudkan nya tentu dengan cara belajar dengan giat, mulai melakukan riset terhadap suatu hal yang saya sukai. mencari pengetahuan dari berbagai sumber dan selalu berusaha. ',	'saya mengikuti organisasi USRC ( UNMANNED SYSTEM RESEARCH CENTER ). oraganisasi ini adalah organisasi kampus yang menjadi wadah mahasiswa untuk melakukan riset terhadapat pesawat nirawak. tidak hanya melakukan riset saja, kami juga merancang dan membuat pesawat nirawak tersebut dan mengikuti perlombaan. seperti yang sudah saya jelaskan sebelumnya, saya amat sangat menyukai hal hal baru dan melakukan riset terhadap suatu hal. oleh karena itu saya mengikuti organisasi ini.',	1,	1654709987,	NULL,	0),
('SCHLR-MCHLS-aa8710',	'USR-MCHLS-e6961',	'Michael Sihotang',	'2004-07-10',	'82285290136',	'Jalan pelesiran Gg. H. Ahmad Safei No. 58/58, Tamansari, Bandung',	'Sistem dan Teknologi Informasi',	'Institut Teknologi Bandung',	'3.49',	'2',	'Perkenalkan nama saya adalah Michael Sihotang. Saya adalah mahasiswa semester 2 di program sarjana Sekolah Teknik Elektro dan Informatika, Institut Teknologi Bandung. Saat ini, saya telah menyelesaikan semester 2 saya dengan baik. Saya bisa lulus di semua mata kuliah saya sehingga saat ini saya sedang pulang ke rumah bersama dengan keluarga saya. Walaupun hari libur, saya tetap ada kesibukan. Saya bersama dengan dua orang teman saya membuka bimbel untuk mahasiswa semester satu di mata kuliah Matematika, Fisika Dasar, dan Pengenalan Komputasi. Saat di semester satu, kami bertiga bisa memberikan peforma yang baik di mata kuliah tersebut sehingga kami memiliki niat dan merelisasikan suatu bimbel untuk mahasiswa baru semester satu yang bernama \"Markas TPB\". \r\n\r\nSelain itu, saat ini saya juga sedang menjalankan tugas sebagai ketua divisi manajemen pada penerimaan mahasiswa baru pada suatu unit keagamaan di ITB. Saya sangat senang dalam berorganisasi karena dapat mempertajam soft skill yang saya miliki seperti dapat bekerja sama dengan tim, belajar kepemimpinan, belajar komunikasi, dll. Selain itu saya juga aktif di beberapa kepanitiaan dan organisasi yang ada di dalam kampus maupun luar kampus seperti collegacy Indonesia, badan pengurus angkatan, google developer student club, amateur radio club, dan sejutacita Indonesia. \r\n\r\nSaya adalah orang yang sangat suka bekerja sehingga saya berusaha untuk mencari kegiatan yang dapat berguna bagi masyarakat dan bagi diri saya sendiri. Saya sangat suka berkomunikasi dengan orang banyak karena saya bisa belajar banyak hal dalam berkomunikasi karena saya sangat meyakini bahwa menjadi seorang mahasiswa bukan hanya sekadar lulus mata kuliah namun harus bisa berguna bagi teman, organisasi, kampus, dan orang tua. Saya lahir dari keluarga yang sangat baik dalam mendidik anak. Saya sadar, keluarga kami bukan keluarga yang memiliki harta yang banyak sehingga kami bisa berbahagia. Tetapi, saya memiliki ayah yang pekerja keras dan ibu yang bijaksana dalam pengolahan keuangan. Saya terkadang sangat kagum dengan ibu saya karena bisa mengolah penghasilan ayah saya yang dapat dikatakan tidak banyak. Ibu saya pernah berkata \" sedikit itu cukup, banyak itu bisa saja kurang\". Hal itu membuat saya kagum dengan ibu saya yang mengajarkan saya bahwa walaupun memiliki harta sedikit namun masih cukup untuk memenuhi kebutuhan. Tetapi bisa saja dengan harta yang sangat banyak, namun berkekurangan. \r\n\r\nSaya akan menceritakan tentang kelebihan dan kekurangan saya. Saya adalah orang yang bisa bekerja sama dengan tim. Saya sangat disenangi oleh teman-teman dalam organisasi maupun kepanitiaan karena saya adalah orang yang tepat waktu dan peduli terhadap teman satu tim. Hal ini saya peroleh dari bergabung dengan beberapa organisasi maupun kepanitiaan yang membuat saya banyak belajar dalam bekerja sama. Saya juga adalah orang yang mampu mengolah keuangan dengan baik. Dengan kecilnya penghasilan dari orang tua saya, terkadang uang bulanan yang diberikan ibu saya tidak cukup bagi saya sehingga saya mengajar untuk memperoleh uang bulanan tambahan. Sebagai manusia yang tidak sempurna, saya juga memiliki banyak kekurangan. Saya cukup sulit untuk memahami materi pembelajaran secara akademik. Oleh karena itu, saya harus memiliki waktu belajar yang lebih banyak dibanding teman-teman saya. Saya juga sering datang ke kos teman saya untuk diajari. Dengan ketekunan itu, saya tetap bisa mengikuti perkuliahan dengan baik bahkan bisa menjadi tutor. Selanjutnya, saya juga adalah orang yang sangat mudah emosi. Terkadang dengan masalah yang kecil, saya bisa emosi. Oleh karena itu saya bergabung dengan beberapa organisasi agar bisa mengontrol emosi saya dan belajar menerima ketidaksempurnaan setiap perilaku dan tindakan yang ada di dunia ini.',	'Saya memiliki mimpi terbesar saya dalam hidup saya adalah bisa berkarier di Badan Usaha Milik Negara (BUMN). Saat saya masih duduk di bangku SMP, ibu saya bercerita mengenai bagaimana cita-cita beliau ingin menjadi PNS tetapi gagal. MuLai dari saat itu, saya berpikir untuk bisa menjadi PNS. Saat SMA, banyak senior saya bercerita mengenai BUMN dan PNS dan saya lebih tertarik untuk berkarir di BUMN khususnya Telkom. Oleh karena itu, saya memberanikan diri untuk masuh Sekolah Teknik Elektro dan Informatika, Institut Teknologi Bandung. Saya sangat berharap bisa berkarir di telkom setelah saya lulus sarjana. Saya akan rajin belajar dan mempersiapkan diri dengan matang bukan hanya ilmu secara akademik namun saya mengikuti kursus bahasa inggris, kursus pemograman, aktif organisasi, dan selalu berusaha melakukan yang terbaik di dalam kehidupan sehari-hari saya. Saya selalu berprinsip bahwa masa lalu hanya bisa menjadi pelajaran, masa depan penuh dengan harapan, dan masa kini adalah saat dimana saya bisa melakukan hal-hal yang terbaik dari dalam diri saya. Saya juga berusaha untuk memperoleh beasiswa guna untuk membantu saya dalam bidang finansial terutama dalam bidang softskill dan dorongan belajar yang baik.',	'Saya memiliki beberapa pengalaman organisasi maupun relawan :\r\n1. Volunteer Say Yes to Books\r\nSaat saya menjadi relawan disini, saya bertugas untuk melakukan kunjungan ke panti asuhan yang ada di Medan untuk meminjamkan buku sekali dalam seminggu. Dalam tim, kami membagi empat kelompok agar bisa mengunjungi empat panti asuhan sekaligus. Saat menjadi relawan, kami juga melakukanacara di Kabupaten Toba dan saya menjadi salah satu speaker yang membawakan materi \"Dare to Dream\".\r\n2. Business Development Sujutacita Indonesia\r\nSaat menjadi relawan di Sejutacita Indonesia, kami ada lima orang dalam satu kelompok. Kelompok kami bertugas untuk melakukan survey minat baca pelajar di Indonesia dan menemukan solusinya. Kami menemukan solusi untuk membuat Booku atau fitur pada aplikasi untuk mendengarkan buku (audio book).\r\n3. Staff of Publid Relation, Collegacy Indonesia\r\nSaya bertugas untuk mencari media partner untuk setiap acara yang dilaksanakan collegacy Indonesia dan menjadi narahubung antara collegacy Indonesia dengan pihak luar seperti juri, peserta, dll. \r\n4. Kesejahteraan Mahasiswa STEI ITB angkatan 2021\r\nSaya bertugas untuk melakukan konseling dengan mahasiswa yang butuh teman cerita, menginformasikan beasiswa kepada mahasiswa, mengajak mahasiswa untuk melakukan olahraga bersama, dll. \r\n5. Persekutuan Mahasiswa Kristen ITB\r\nSaya menjabat sebagai anggota divisi internal PMK ITB yang bertanggung jawab dengan pendataan mahasiswa dahn hubungan antara pengurus dan anggota PMK ITB. Saat ini saya juga menjawab sebagai ketua divisi manajemen di penerimaan mahasiswa baru PMK ITB 2022.',	1,	1655287528,	NULL,	0),
('SCHLR-MCHMD-70f497',	'USR-MCHMD-f4237',	'Mochamad Rizaldi',	'2004-01-31',	'83150187650',	'Jalan Sarijadi Blok 18 No.99 RT.03 RW.06 Kel.Sarijadi Kec.Sukasari Kota Bandung',	'IPA',	'SMA Negeri 15 Bandung',	'9.20',	'6',	'Selamat Pagi Bapak/Ibu,\r\nPerkenalkan nama saya Mochamad Rizaldi, umur saya 18 tahun, saya adalah lulusan SMA dari instansi SMA Negeri 15 Bandung jurusan IPA dengan nilai akhir 92.07. \r\nImpian saya untuk bekerja di Bank Syariah mengantarkan saya untuk menuntut ilmu di jurusan Ilmu Ekonomi dan Keuangan Islam, Universitas Pendidikan Indonesia.\r\nSaya menyadari bahwa melanjutkan gelar sarjana adalah suatu keharusan dalam mewujudkan mimpi saya, sedangkan di dalam prosesnya pasti membutuhkan banyak uang. Saya tidak bisa meminta bantuan kepada orang tua saya karena beberapa alasan. Inilah mengapa saya disini sekarang, melamar beasiswa ini.',	'Mimpi terbesar dalam hidup saya adalah menaikkan derajat kedua orang tua saya. Kedua orang tua saya hanya lulusan SMA. Alhamdulillah tahun ini saya diberikan kesempatan oleh Tuhan Yang Maha Esa untuk meneruskan pendidikan ke jenjang yang lebih tinggi. Kedua orang tua saya tidak pernah menyangka, dengan keadaan ekonomi yang sedang sulit anaknya kelak akan menjadi lulusan sarjana. Walaupun keadaan ekonomi keluarga sedang tidak mendukung untuk melanjutkan pendidikan ke jenjang yang lebih tinggi, saya tidak akan pernah untuk menyerah agar mimpi saya terwujud. Saya akan berusaha semaksimal mungkin untuk mengikuti beasiswa ataupun jika diperlukan bekerja, saya akan bekerja paruh waktu agar impian saya terwujud untuk bisa menaikkan derajat kedua orang tua saya.',	'Saya memiliki beberapa pengalaman organisasi semasa sekolah dari SD hingga SMA. \r\nWaktu Sekolah Dasar saya mengikuti organisasi PASKIBRA (Pasukan Pengibar Bendera) dan Pramuka (Praja Muda Karana).\r\nPada masa SMP saya mengikuti organisasi beladiri yaitu Karate, dan di masa SMA saya tidak mengikuti organisasi melainkan lebih fokus terhadap pelajaran karena impian saya ingin lulus SNMPTN, tapi pada akhirnya saya sadar bahwa itu suatu keputusan yang salah, di dalam suatu organisasi kita bisa mendapatkan ilmu yang tidak diajarkan di dalam kelas, kita dapat mengembangkan soft skill hingga bertambahnya relasi itu sangat penting. Saya tidak akan mengulangi kesalahan yang sama ketika di bangku perkuliahan, saya akan mencoba untuk mengikuti beberapa organisasi agar soft skill saya berkembang serta relasi saya bertambah.',	1,	1655650212,	NULL,	0),
('SCHLR-MCHMD-89ba26',	'USR-MCHMD-fc291',	'Mochamad Maulana ',	'2002-05-25',	'85894946916',	'KOTA BOGOR , kec. BOGOR TIMUR , kel. Katulampa , Jln Katulampa RT 03 RW 09  , kode pos 16144  No rumah 91 ',	'Komunikasi penyiaran Islam/ Da',	'Universitas Islam negeri sunan',	'3.64',	'4',	'nama saya Mochamad Maulana, usia 20 tahun, tinggal di Bogor. saya anak ke tiga dari tiga bersaudara . saya suka sekali berorganisasi dan berkegiatan dikampus. saya bertanggung jawab atas apa yang saya kerjakan, terkadang saya juga tidak memikirkan kondisi kesehatan saya karena sukanya terhadap kegiatan-kegiatan yang ada dikampus. saya sering kali dipanggil disekolah sma saya dulu untuk memberi materi tentang keorganisasian kepada pengurus OSIS. saya juga sedang mencari beasiswa-beasiswa agar meringankan beban orang tua saya ',	'Saya bermimpi ingin menjadi penyiar radio yang profesional, karena saya mengambil jurusan komunikasi penyiaran Islam, makanya saya belajar tentang peradioan agar saya mempunyai skill dibidang penyiaran ',	'Saya waktu SMA menjadi kepengurusan OSIS dan menjadi ketua Pramuka (Pradana) saya sering kali mengikuti seminar atau kegiatan yang lainnya. Sekarang saya mengikuti himpunan mahasiswa jurusan, dan beberapa organisasi yang ada. Seperti komunitas lingkar barudak khotabah, dan PMII',	1,	1654066360,	NULL,	0),
('SCHLR-MDYSL-6aced0',	'USR-MDYSL-771f8',	'Maudy selvia erwinda',	'2003-05-15',	'85810545169',	'Jalan amal talang ratu Rt.36 Rw.11 Kec.Alang-Alang Lebar Kel.Srijaya',	'Ilmu Tanah Pertanian',	'Universitas Sriwijaya',	'3.93',	'2',	'Menurut saya, saya itu orangnya plin plan akan suatu hal dan terlalu terburu-buru melakukan sesuatu. Tetapi, saya orangnya pantang menyerah tentang kegagalan. Karena, saya sedikit membenci kata gagal. Oleh karena itu, saya akan tetap mencobanya sampai berhasil.',	'Mimpi besar saya yaitu menjadikan kehidupan orang tua, keluarga dan saya menjadi lebih baik dari sebelumnya. Contohnya tidak kesulitan tentang keuangan. Cara saya untuk mewujudkannya yaitu saya harus menjadi orang sukses terlebih dahulu dan bisa menghasilkan uang sendiri sehingga bisa membantu kehidupan keluarga.',	'Pengalaman organisasi saya pernah ikut organisasi Rohis (Rohani Islam) di SMP dan SMA saya menjabat sebagai seketaris dan sosial media. Di kuliah saya melanjutkan organisasi keagamaan di LDF (Lembaga Dakwah Fakultas) dan saya diamanahkan di Dapartemen IMC (Islamic Media Center) yang bertugas mengatur desain pamflet dan publikasi di media sosial. ',	1,	1653583007,	NULL,	0),
('SCHLR-MFTHL-42c6ac',	'USR-MFTHL-d833e',	'Miftahul Hidayati',	'2004-04-05',	'81226921991',	'Jalan Sultan Agung Rt 09 Rw 01 Sepanjang Kec. Gondanglegi Kab. Malang',	'MIPA',	'Universitas Negeri Malang',	'0.00',	'0',	'Saya masih proses menunggu pengumuman sbm, tepatnya di Universitas Negeri malang. Saya mendaftar beasiswa ini karena saya ingin meringankan beban kedua ortu saya. Saya ingin menggaoai cita2 saya tanpa membebani mereka kalau pun saya tidak lolos sbm tahun ini setidaknya saya mendapat beasiswa ini untuk saya mendaftar di pts karena biaya yang pasti lebih mahal dari ptn membuat saya gelisah untukitu saya berharap mendapat beasiswa ini',	'Mimpi terbesar saya adalah menjadi orang yang sukses tanpa menjadi beban keluarga, dalam arti saya akan mewujudkan mimpi saya dengan usaha yang saya lakukan. Saya mewujudkannya dengan cara saya berusaha dan mencoba di setiap jalur yang ada tak lupa berdoa pada yang maha Kuasa untuk dipermudahkan dalam setiap jalan yang saya tempuh',	'Saya tidak mempunyai pengalaman berorganisasi ataupun relawan, saya juga bukan orang yang aktif. Tapi saya gemar mengikuti olimpiade. Meskipun tidak mendapat juara tapi saya senang mencoba beberapa hal baru',	1,	1654087367,	NULL,	0),
('SCHLR-MGNT-1c6c83',	'USR-MGNT-67d9ac',	'Emia Aginta',	'2005-01-22',	'82278248576',	'Dusun VI bangun baru desa namu ukur Utara kecamatan Sei Bingai Kabupaten Langkat Provinsi Sumatera Utara',	'IPS',	'SMA Negeri 2 Binjai',	'0.00',	'4',	'Saya merupakan merupakan seorang remaja yang memiliki keinginan menjadi seorang role model bagi remaja lainnya. Saya memiliki semangat dan tekad yang kuat. Saya begitu tertarik dengan dunia perlombaan, kompetisi dan olimpiade. Saat ini mungkin masalah terbesar saya ialah masalah finansial. Saya merupakan anak kedua dari dua bersaudara. Ayah saya sudah meninggal dunia sejak saya berusia dua tahun. Ibu saya meninggal dunia satu tahun yang lalu. Sekarang Kakak laki-laki saya lah yang membiayai hidup saya. Ia banting tulang bekerja untuk membiayai makan dan sekolah saya, di tengah kesibukannya sebagai mahasiswa tingkat akhir. Untuk itu saya mendaftar berbagai beasiswa. Walaupun hingga saat ini saya belum pernah mendapatkannya:)',	'Saya memiliki mimpi yang besar untuk menjadi seorang wanita karir yang sukses, menginspirasi dan dapat bermanfaat bagi orang lain. Saya memiliki cita-cita menjadi seorang psikolog. Saya tau untuk menjadi psikolog tidaklah mudah. Harus menamatkan pendidikan hingga jenjang S2. Untuk itu saya belajar dengan giat dari sekarang. Agar mendapatkan nilai yang tinggi. Besar harapan saya agar dapat melanjutkan pendidikan di universitas ternama dengan beasiswa pendidikan. Tidak lupa usaha dan kerja keras yang saya lakukan, saya selalu berusaha untuk melakukannya dengan baik. Karena bagi saya, selain melakukan segala hal dengan kerja keras, haruslah melakukannya dengan benar pula.',	'Iya, di sekolah saya mengikuti organisasi OSIS, Rohis (Rohani Islam), dan PIK-R (Pusat Informasi Konseling Remaja).\r\n\r\nDi OSIS, tepatnya bulan Ramadan kemarin, saya ikut andil dalam kegiatan berbagi dengan anak yatim dan kurang mampu.\r\n\r\nDi rohis, saya masuk divisi danur, divisi yang mengatur keuangan organisasi ini. Kami sering melakukan kegiatan bakti sosial dan amal. Yang mana hal ini tidak hanya kami lakukan di bulan ramadhan saja.\r\n\r\nOrganisasi PIK-R mungkin menjadi modal saya untuk masuk ke organisasi luar sekolah yang sangat bagus, yaitu Forum GenRe (Generasi Berencana) Kota Binjai. Di forum ini saya belajar banyak hal. Terlebih forum ini adalah wadah bentukan BKKBN yang bertujuan untuk menyiapkan para remaja yang berencana. Yang mana GenRe sendiri memiliki 4 subtansi, yaitu kependudukan, kesehatan reproduksi, penyiapan kehidupan berkeluarga dan life skill. Pada bulan ramadhan kemarin kami turun ke jalanan untuk mengumpulkan donasi yang kami salurkan kepada para anak yatim kota Binjai. Kami bekerja sama dengan organisasi Yakesma Binjai.\r\n\r\nSaat ini saya sedang mendaftarkan diri menjadi Duta Genre kota Binjai. Alasan saya mendaftar menjadi Duta Genre ialah ingin menjadi seorang Fasilitator, konselor, motivator, inspirator sekaligus role model bagi para remaja khususnya di kota Binjai. Saya sudah mengikuti live audition di hari Minggu kemarin. Tinggal menunggu pengumuman untuk maju ke tahap berikutnya yaitu tahap karantina top 20. Besar harapan saya untuk Lolos, aamiin.',	1,	1655745104,	NULL,	0),
('SCHLR-MGPNJ-16ae48',	'USR-MGPNJ-e2099',	'Mugio Panji Kusuma',	'2004-10-31',	'81369657703',	'Perumnas Griya Selawi Indah Blok DD 105',	'MIPA',	'SMAN 4 LAHAT',	'0',	'0',	'Perkenalkan nama saya Mugio Panji Kusuma, biasa dipanggil Panji. Saya lahir di kota Lahat, Sumatera Selatan, lahir pada tanggal 31 Oktober 2004. Dan saya memiliki 2 saudara laki-laki dan 1 saudara perempuan. Saya tinggal di sebuah desa perumnas griya selawi indah blok dd 105. Hobi rutin ssaya lakukan adalah banyak mengeksplorasi internet tentang perkembangan teknologi.\r\nKemudian saya dilahirkan oleh sosok orangtua yang tangguh dan pekerja keras, yaitu Mugiyono dan Kartini. Kegiatan ayah dan ibu saya sekarang adalah berdagang, kerja keras mereka yang tak kenal rasa lelah menjadikan motivasi saya. Setiap pagi ibu saya selalu bangun lebih awal untuk mempersiapkan dagangannya, terkadang tidurnya pun dibilang tidak cukup demi menghidupi anak-anaknya, itulah motivasi saya mengapa saya harus bersungguh-sunggu dalam menempuh pendidikan dan dapat menaikan derajat mereka, untuk hasil dari kerja keras mereka bisa mencukupi kehidupan sehari-hari kami berempat.\r\nSejak SMA saya bercita-cita untuk menjadi polisi namun nasib berkata lain saya belum lolos di seleksi polisi. Dengan kegagalan itu, ibu dan ayah saya menguatkan saya dan mendukung saya supaya tidak larut dalam kesedihan, dengan itu  saya bertekad untuk bisa membanggakan mereka suatu saat nanti. Kemudian saya memiliki cita-cita baru yaitu bisa berkuliah dengan beasiswa dan lulus di ptn favorit dengan jurus kemudian setelah lulus S1 saya akan bekerja di perusahaan-perusahaan start-up dalam bidang bisnis management. Saat saya SMA tepatnya pada kelas 12 saya memiliki penghargaan peringkat 7 dari 31 siswa dengan predikat sangat baik. Alasan saya untuk bisa berkuliah dengan beasiswa agar dapat meringkan beban kedua orang tua saya, dapat membangun relasi dengan banyak orang yang dimana hal tersebut sangat penting, dan saya bisa memperisapkan diri dengan baik di dunia kerja dengan adanya pelatihan dari pihak pemberi beasiswa.\r\nLangkah saya ke depannya setelah mendapatka beasiswa ini adalah dari ilmu yang saya dapat pada saat pelatihan mentor tentu saja hal tersebut dapat saya manfaatkan untuk saya sharing ke teman-teman yang lain terkait materi apa yang diberikan nanti. \r\nDemikianlah yang dapat saya ceritakan tetang kisah hidup saya yang begitu indah , saya yakin Allah selalu memberikan apa yang menjadi miliknya hamba. Sekian yang dapat saya ceritakan, saya ucapkan terima kasih.',	'Mimpi terbesar saya tentu saja dapat menaikkan derajat kedua orang tua saya, bisa memiliki rumah yang besar, bisa membangun bisnis, dan mimpi saya yang terakhir ini terbilang lucu yaitu suatu saat nanti ketika saya sukses saya ingin banyak bersedekah kepada orang yang membutuhkan, bukan berarti ketika saya tidak sukses saya tidak bersedekah sama sekali, memang lucu bukan? Tetapi hal tersebut yang memotivasi saya untuk bisa cepat menjadi orang yang sukses dunia dan akhirat. Cara saya untuk mewujudkan mimpi saya itu adalah dengan mengikuti sifat yang dimiliki kedua orangtua saya yaitu kerja keras dan kerja cerdas, dengan hal tersebut saya dapat mewujudkan mimpi saya.',	'Ketika saya SMA saya mengikuti organisasi PASKIBRA, dengan saya mengikuti organisasi tersebut saya memiliki sifat yang disiplin, berani, dan bertanggung jawab.\r\nDari sifat yang saya bawa dari organisasi tersebut tentunya berguna untuk kedepannya ketika saya bekerja, dengan dapat disiplin dalam waktu, berani mengambil keputusan, dan bertanggung jawab apa yang saya mulai harus saya selesaikan.',	1,	1653573736,	NULL,	0),
('SCHLR-MHHMD-ab9bbb',	'USR-MHHMD-7631d',	'Muhhamad dimastiar ',	'2003-11-27',	'88270938580',	'Dusun Nenggala kecamatan kandis kabupaten Siak, Riau.',	'Fisika murni FMIPA',	'Universitas Andalas ',	'9.72',	'0',	'Saya merupakan salah satu lulusan Pondok Pesantren yang ada di Riau dengan nilai kelulusan yang cukup baik saya gemar dalam berkomunikasi contohnya menjadi master of ceremony pada acara-acara di Sekolah saya.',	'Saya ingin membuat lapangan pekerjaan yang akan menimalisir para pengangguran yang ada. Cara mewujudkannya dengan tekun dalam belajar, berusa untuk mewujudkannya dan mencari Pengalaman yang baik.',	'Saya merupakan seorang bendahara pusat santri pada organisasi yang ada di Pondok Pesantren dan saya juga menjadi ketua remaja masjid. Alhamdulillah saya mendapatkan nilai terbaik dalam organisasi santri pada tahun 2021.',	1,	1654913115,	NULL,	0),
('SCHLR-MHL-93ef82',	'USR-MHL-0e797c',	'MOH. ALI',	'2002-06-14',	'82259633400',	'Dayo dara',	'S1 ILMU HUKUM',	'Universitas Tadulako',	'3.57',	'2',	'Saya orangnya rajin mengerjakan tugas tetapi saya akan malas ketika ada dosen sedang mengerjakan yang kurang di pahami dan dosen yang jarang masuk.',	'Mimpi saya dari kecil sampai sekarang yaitu ingin sukses terutama ingin cepat selesai S2, cara mewujudkannya saya harus banyak belajar, pengatahuan, pengalaman, dan sabar apapun itu proses yang saya jalankan.',	'Iya, Unit Kegiatan Olahraga Mahasiswa Fakultas Hukum (UKOM), lembaga ini sangat menyenangkan dan banyak pengalaman2 yang kita lalui disana.',	1,	1654936891,	NULL,	0),
('SCHLR-MHL-93f25a',	'USR-MHL-0e797c',	'MOH. ALI',	'2002-06-14',	'82259633400',	'Dayo dara',	'S1 ILMU HUKUM',	'Universitas Tadulako',	'3.57',	'2',	'Saya orangnya rajin mengerjakan tugas tetapi saya akan malas ketika ada dosen sedang mengerjakan yang kurang di pahami dan dosen yang jarang masuk.',	'Mimpi saya dari kecil sampai sekarang yaitu ingin sukses terutama ingin cepat selesai S2, cara mewujudkannya saya harus banyak belajar, pengatahuan, pengalaman, dan sabar apapun itu proses yang saya jalankan.',	'Iya, Unit Kegiatan Olahraga Mahasiswa Fakultas Hukum (UKOM), lembaga ini sangat menyenangkan dan banyak pengalaman2 yang kita lalui disana.',	1,	1654933455,	NULL,	0),
('SCHLR-MHMD-06b547',	'USR-MHMD-70b542',	'M. Hamdi',	'2005-05-27',	'82260244065',	'Jorong Tabing Ranah Nagari Simalanggang Kecamatan Payakumbuh kabupaten Lima puluh kota provinsi Sumatera barat',	'IPA',	'SMA Negeri 1 Kecamatan Payakum',	'0.00',	'0',	'Saya merupakan anak pertama dari 3 orang bersaudara, keluarga saya kekurangan biaya untuk menyekolahkan saya ',	'Pengen menjadi seorang dokter dengan cara giat belajar dan mencari tambahan biaya dan juga beasiswa agar bisa masuk ke perguruan tinggi yang ingin saya capai',	'Saya merupakan sekertaris komisi A organisasi mpk  di sekolah , dulu ketika SMP saya juga pernah menjadi anggota pengurus OSIS',	1,	1654769903,	NULL,	0),
('SCHLR-MHMDD-4b51b8',	'USR-MHMDD-55ff4',	'Muhamad Adrian',	'2002-06-13',	'87855371892',	'Ngorok, kopang, kopang rembiga, Lombok Tengah NTB',	'Ekonomi syariah/ekonomi/ekonom',	'Universitas Islam Negri Matara',	'3.48',	'2',	'Saya adalah mahasiswa di uinversitas Islam Negri mataram, semster 2, jurusa ekonomi syariah Fakultas ekonomi dan bisnis islam',	'Mimpi terbesar saya adalah menjadi mentri ekonomi, dan cara saya untuk mewujudkanya adalah\r\n1. Menjadi berguna di masyarakat di desa saya dan dimana pun saya berada, membangun relasi dengan baik dengan masyarakat\r\n2. Membangun relasi dengan orang orang pentinh dengan acra mengikuti setiap kegiatan dan ikut serta dalam organisasi yang dapat menambah pengalamn dan menambah relasi\r\n3. Tetap mempererta hubungan didalam organisasi, meperbanyak relasi di dalam organisasi dapat menjadi orang oenting di dalam organisasi agar dapat dikenal orang banyak',	'Saya memiliki pengalamn organisasi.\r\n1. Saya menjadi ketua osisi di sekolah saya sekama 2 priode dan memimpin siswa kurang lebih 500 orang laki laki maupun perempuan\r\n2.mengikuti PMII dan melakukan penggalangan dana bagi bencana di daerah bima NTB yaitu kebakaran.\r\n3. Hmj di fakultas melakukan penggalangam dama bagi anak anak yatim dan memberikan kepada fakir miskin. Dan mebantu para mahasiswa baru yang berdaftar di fakultas kami dan meperdayakan anggota',	1,	1654238796,	NULL,	0),
('SCHLR-MHMDH-16583e',	'USR-MHMDH-1d10b',	'Muhamad Ihsan Nudin',	'2002-10-24',	'85715932192',	'JL.CIPINANG MUARA I NO.9 RT.012/RW.002 Kelurahan Pondok Bambu, Kecamatan Duren Sawit, Jakarta Timu, DKI Jakarta',	'Teknik Industri',	'Universitas Singaperbangsa Kar',	'3.82',	'2',	'Halo perkenalkan nama saya Muhamad Ihsan Nudin, saat ini saya berusia 19 Tahun, dan beralamatkan di Jakarta Timur, pada saat ini saya sedang menempuh pendidikan di Universitas Singaperbangsa Karawang dengan mengambil Studi S1 Teknik Industri dimana saya melanjutkan di teknik industri karena saya sangat tertarik di bidang Keteknikan. Ketika SMK saya mengambil jurusan Teknik Kendaraan Ringan dari situ saya tertarik dengan keteknikan karena saya melihat semakin lama teknologi semakin canggih dan membuat saya kagum dan di teknik industri inilah saya berharap bisa ikut berperan dan berkontribusi dalam perkembangan teknologi di masa depan di indonesia.\r\nSaya mempunyai cita-cita menjadi seorang ahli teknologi yang dapat membangun suatu sistem teknologi dengan menerapkan ramah lingkungan, karena saya cukup melihat negara indonesia sebagai negara industri terbesar dengan dukungan sumber daya alam maupun manusia yang cukup melimpah. \r\nDan pada saat ini kesibukan saya adalah belajar terus menerus agar semua cita-cita saya terwujud.',	'Menjadi ahli teknologi seperti insinyur dan menciptakan suatu sistem atau menerapkan hasil ilmu yang saya peroleh di bangku kuliah dari prodi saya Teknik Industri, dengan bekerja di suatu perusahaan dan merepkan sebuah sistem industri massal, yang dapat membuka lowongan pekerjaan bagi masyarakat di indonesia, dengan terus menerapkan suatu perinsip yaitu ramah lingkungan. Indonesia adalah negara yang mempunyai peluang sangat besar dimana Sumber Daya Alam dan Manusia yang sangat melimpah. Dari situ sebenarnya indonesia akan menjadi negara yang dapat mensejahterahkan masyarakatnya. Itulah Mimpi terbesar saya. \r\n\r\nlalu bagaimana cara mewujudkannya? Saya pernah membaca sebuah buku, di dalam buku tersebut mengatakan \"Siapa diri anda sebernnya di tentukan oleh apa yang ingin anda perjuangkan\" dari kalimat tersebut maka saya akan terus berjuang dengan terus belajar, dengan terus menambah pengalaman saya agar bisa segera terwujud. Ketika saya bisa di terima dalam program Beasiswa Pemuda yang di selenggarakan yayasan YBB adalah salah satu bentuk perjuangan yang saya lakukan, dikarenakan ketika saya keterima akan banyak benefit yang akan saya dapatkan dimana saya dapat mengupgrade skill saya dan mendapatkan mentoring yang pastinya mempunyai visi dan misi yang sama dengan saya yaitu ikut berkontrubusi untuk membangun bangsa bersama-sama',	'saya memiliki pengalaman pada saat di SMP yaitu di bidang Pengembangan Sumber Daya Manusia yang memiliki tanggung jawab untuk membuat kegiatan dan program untuk meningkatkan keahlian siswa, tetapi pada saat itu saya lebih berperan membantu Ketua Osis menjalankan tugasnya di setiap seluruh program yang telah dibuat seluruh divisi\r\n\r\nKemudian Organisasi berikutnya pada SMP juga saya mengikuti Organisasi Pramuka di SMPN 148 Jakarta, di dalam organisasi pramuka ini saya dibimbing dan di bina untuk menjadi manusia yang lebih mandiri,bertanggung jawab dan juga mempunyai disiplin yang tinggi,\r\n\r\nKetika saya SMK saya juga tetap mengikuti organisasi pramuka tetapi tetap dengan naungan yang sama berada di organisasi pramuka SMPN 148 Jakarta, dengan mempunyai tugas sebagai divisi kegiatan, yaitu membuat program dan kegiatan yang akan dilaksanakan dan membantu melatih adik tingkat dalam berpramuka dan menjadi diri yang lebih baik.',	1,	1655699493,	NULL,	0),
('SCHLR-MHMDK-1933d5',	'USR-MHMDK-e1960',	'Muhamad Karifal',	'2003-07-17',	'83826537701',	'Kp. Sukatani 001/005 Ds. Karangjaya Kec. Tirtamulya Kab. Karawang Prov. jawabarat',	'Islamic education management',	'Singaperbangsa Karawang Univer',	'3.56',	'1',	'Saya adalah anak ke 1 dari 2 bersaudara, saya tinggal bersama orangtua saat, hobi saya berolahraga, keseharian saya ketika tidak ada kegiatan sering melakukan bersih bersih di rumah, saya orangnya pekerja keras dan kadang saat itu pula saya bisa menjadi pekerja ceroboh, tapi dengan doa saya akan memperbaikinya.',	'Saya mempunyai cita-cita menjadi Ahlul Qur\'an, mempunyai pondok pesantren, pada saat ini saya pun mukim di pondok pesantren al Furqon Karawang, maka dari itu saya terus berusaha dengan sungguh-sungguh karena dalam hadits \"man jadda wajada\", selain itu pun saya ingin menjadi kepala sekolah karena itu saya sekarang kuliah di prodi manajemen.',	'Pada saat saya tengah menduduki bangku SMP kelas 8 saya menjadi ketua OSIS, dan ketua Ekstrakurikuler Badminton, keduanya saya tekuni agar jasmani dan rohani saya teratur dan seimbang, ketua OSIS untuk kekuatan intelektual dalam berorganisasi dan Olahraga untuk membugarkan jasmani',	1,	1655691400,	NULL,	0),
