('SCHLR-MHMDZ-c43100',	'USR-MHMDZ-38a83',	'Muhamad Zakhi Ramadhan',	'2002-11-09',	'85645011778',	'Jalan Semolowaru Bahari Selat Badung 16 Surabaya, Jawa Timur',	'Pendidikan Guru Sekolah Dasar',	'Universitas Trunojoyo Madura',	'3.50',	'4',	'Saya orang dengan keingin tahuan yang tinggi dan saya senang dengan hal hal baru terutama yang berbau pendidikan',	'Mimpi saya ingin menjadi orang kaya no2 se-Indonesia dan saya berusaha mewujudkannya dengan dini saya belajar secara giat agar nantinya dapat sukses dunia dan akhirat',	'Tidak ada',	1,	1654098411,	NULL,	0),
('SCHLR-MHMMD-0a2672',	'USR-MHMMD-6ffa5',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655658054,	NULL,	0),
('SCHLR-MHMMD-0dff1f',	'USR-MHMMD-8697b',	'Muhammad Arbi Yasin',	'2004-06-02',	'85835523970',	'Tanjung,Pandai Sikek Kec.X Koto Kab.Tanah Datar Sumbar',	'Bisnis Daring dan Pemasaran',	'SMKN 1 PADANG PANJANG',	'3.56',	'0',	'Diriku ialah sosok yang sejak kecil sudah mengerti tentang arti kehidupan..Mengapa? Karena diriku saat kecil sudah tidak merasakan kasih sayang kedua orang tua karena ada problematika dari kedua orangtuaku yang membuat diriku ditinggalkan,Aku pun hidup menumpang dengan bibi yang merawatku dari kecil,Lalu bibi mengajarkan semua tentang arti kehidupan,Bagaimana aku harus mewujudkan cita-cita ku walau tanpa kasih sayang orang tua dan berharap aku akan menjadi orang yang sukses,Dari situlah aku belajar bahwa aku sudah beruntung sudah dirawat dengan baik hingga sampai sekarang dan bertekad kuat untuk menggapai mimpi dan cita- cita yang diharapkan.Aku juga siswa berprestasi dan aktif dalam berorganisasi Diantara prestasi ku adalah \r\n1.Studi banding Internasional siswa berprestasi ke malaysia dan singapura se kabupaten tanah datar\r\n2.Juara 3 olimpiade bahasa inggris tingkat antar kabupaten kota disumbar\r\n3.Juara 3 Lomba Poster Literasi Tingkat Kota Padang Panjang dan sekitarnya\r\nDan juga aktif berorganisasi yaitu diantaranya\r\n1.Wakil Ketua Osis SMKN 1 Padang Panjang T.P 2020/2021\r\n2.Anggota KNPI Kota Padang Panjang\r\n3.Remaja Mesjid Aktif dari Masjid Nurul  Huda Pandai Sikek\r\nSemua itu kulakukan bukan semata untuk membanggakan,Akan tetapi bagaimana aku mengembangkan potensi diri yang ada untuk menggapai semua cita cita agar menjadi orang yang maju,berpendidikan dan bahagia didunia atau akhirat kelak walaupun kadang aku harus menerima pahitnya kejadian yang terjadi dikeluargaku dan aku berharap suatu hari nanti aku yang akan mengubah keluargaku menjadi lebih baik lagi',	'Mimpi terbesarku adalah menjadi seorang CEO perusahaan \r\nAku masuk ke SMKN 1 Padang Panjang dengan jurusan Bisnis Daring dan Pemasaran supaya tahu bagaimana menjadi seorang pembisnis yang baik dan teroganisir Lalu nantinya aku akan melanjutkan pendidikan keperguruan tinggi dengan jurusan bisnis dan manajemen,Rencanany aku akan mempersiapkan sebaik mungkin dengan rajin belajar agar bisa kuliah S1 di luar negeri ataupun didalam negeri\r\nLalu jika aku tamat S1 Bisnis Manajemen aku akan melanjutkan pendidikan S2 dengan jurusan Administrasi Bisnis sambil mencari pekerjaan terbaik sesuai kemampuanku dan mencoba memulai merintis usaha bisnis layanan transportasi dan makanan  digital seperti layaknya pak Nadiem Makarim CEO dari Perusahaan Gojek Lalu ketika tamat S2 Mencoba terus mengembangkan usaha tersebut dengan segala aspek baik dari SDA dan yang terutama SDM yang berkualitas tinggi dan keyakinan pada diri sendiri hingga suatu saat aku akan berucap\"Ya Aku sukses merintis mimpiku dari kecil\"',	'Ada\r\nPengalamanku berorganisasi bisa dibilang cukup\r\nAku pernah Menjadi Wakil Ketua Osis dimana kami menjadi relawan dengan memberikan sembako kepada masyarakat yang membutuhkan disekitar sekolah,Meminta sumbangan untuk korban bencana alam,Penggalangan dana untuk musibah yang menimpa warga sekolah\r\nDan Menjadi Panitia Aktif pada Acara\" keagamaan di mesjid seperti Mtq,Khatam Alquran yaitu turun kelapangan meminta sumbangan acara,Sebagai seksi acara yang aktif,Pembagian sembako anak yatim dan berbagai hal lain yang pernah dilakukan dalam acara yang dibuat oleh remaja mesjid',	1,	1654415098,	NULL,	0),
