('SCHLR-MHMMD-15f1c2',	'USR-MHMMD-1401d',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654152474,	NULL,	0),
('SCHLR-MHMMD-182ac3',	'USR-MHMMD-39fac',	'MUHAMMAD IS\'AD ROZAN',	'2003-10-07',	'81231493856',	'Mutiara Residence D3/02, Anggaswangi, Sukodono, Sidoarjo, Jawa Timur 61258',	'Teknik Lingkungan',	'Universitas Diponegoro',	'0.00',	'1',	'Perkenalkan, saya Muhammad Is\'ad Rozan yang akrab dipanggil Rozan, bagi saya keberadaan anak pertama dari kedua bersaudara merupakan keberadaan yang sangat penting karena akan menjadi tonggak semangat dan motivasi adik saya terutama dalam hal pendidikan. Tepat pada tahun ini saya telah menyelesaikan pendidikan di jenjang SMA tepatnya di MAN Sidoarjo. Dengan rasa syukur kepada Allah swt. pada tahun ini juga saya diterima di salah satu perguruan tinggi favorit di Indonesia tepatnya Universitas Diponegoro melalui jalur Seleksi Bibit Unggul Berprestasi (SBUB). Tentunya, diterimanya saya pada jalur SBUB Universitas Diponegoro ini tidak terlepas dengan minat dan bakat yang selama ini saya tekuni selama di jenjang SMA, serta semangat yang kuat untuk terus berprestasi. Sejak duduk di jenjang SMA saya sangat tertarik pada bidang riset/penelitian dan syukur Alhamdulillah berkat restu orang tua dan semangat saya pada jenjang SMA saya berhasil mendapatkan penghargaan di bidang riset/penelitian dengan total 6 medali emas, 2 medali perak, 2 medali perunggu dan 4 finalis baik di tingkat nasional maupun Internasional. Hingga pada akhir tahun 2021 saya mendapatkan penghargaan dari Bupati Sidoarjo berupa Pemuda Pelopor Kabupaten Sidoarjo tahun 2021. Berdasarkan pengalaman saya, saya berkeinginan untuk meanjutkan pendidikan yang lebih tinggi salah satunya di Universitas Diponegoro. Serta, terus mengembangkan potensi potensi minat dan bakat yang ada dalam diri saya salah satunya yaitu dengan mengikuti program beasiswa YBB Scholarship ini. Dengan diterimanya saya sebagai awardee \"YBB Scholarship\" ini saya berkomitmen untuk lebih meningkatkan minat, bakat, dan prestasi saya melalui program-program yang diadakan oleh YBB serta melanjutkan pendidikan saya di Universitas Diponegoro dengan maksimal terutama terbantu dalam segi financial mengingat pendidikan tinggi membutuhkan financial yang mencukupi.',	'Sesuai dengan visi saya sejak kecil yaitu menjadi kebanggaan kedua orang tua dan selalu bermanfaat bagi kehidupan sekitar. Mimpi terbesar saya yaitu menjadi sosok anak yang dapat membanggakan kedua orang tua saya serta selalu menjadi pribadi yang dapat bermanfaat dan berguna di masyarakat. Cara yang akan saya tempuh untuk mencapai mimpi saya yaitu dengan menggali dan terus melatih potensi-potensi yang ada dalam diri saya dengan terus melanjutkan pendidikan yang lebih tinggi serta mengikuti program-program yang akan melatih saya untuk mengembangkan potensi saya yaitu dengan mengikuti program \"YBB Scholarship\". Melalui program ini saya berkeinginan untuk menghasilkan suatu karya-karya yang akan bermanfaat bagi bangsa dan negara khususnya bagi masyarakat sekitar.',	'Selain berprestasi di bidang akademik khusunya di bidang riset/penelitian, saya memiliki beberapa pengalaman ke organisasian yang melatih saya untuk meningkatkan jiwa kepemimpinan saya diantaranya:\r\n1. Ketua Karang Taruna RW 09 Desa Anggaswangi Kabupaten Sidoarjo (periode 2019-2020)\r\n2. Ketua tim penelitian MAN Sidoarjo \"MANSDA RESEARCH\" (periode 2020-2021)\r\n3. Ketua pelaksana kompetisi penelitian nasional \"MANSDA RESEARCH COMPETITION\" pada tahun 2021\r\n4. Ketua pelaksana webinar tingkat nasional \"Peran Madrasah dalam Perkembangan Riset di Indonesia\" pada tahun 2021\r\n',	1,	1655731067,	NULL,	0),
('SCHLR-MHMMD-1ec81c',	'USR-MHMMD-75ec0',	'Muhammad Haidar Raziq',	'2002-09-30',	'85606231592',	'Duku Bulu No 29A, Kecamatan Sambikerep, Surabaya, Jawa Timur',	'S1 Akuntansi/Fakultas Ekonomik',	'Universitas Negeri Surabaya',	'3.67',	'4',	'Saya merupakan mahasiswa semester 4 dari Unesa dengan prodi akuntansi,  selama berkuliah saya aktif di beberapa kegiatan kemahasiswaan dan juga mengikuti beberapa perlombaan. Pernah mendapatkan penghargaan berupa top 7 LKTI di UNY dan juga mendapatkan pendanaan sebesar Rp. 3.500.000 dari kegiatan Program Mahasiswa Wirausaha. Saya orang yang mau belajar hal baru, tanggung jawab,  kreatif dan tidak mudah menyerah. ',	'Mimpi terbesar saya adalah dapat melanjutkan kuliah di universitas luar negeri , cara untuk mewujudkan mimpi tersebut yaitu dilakukan dengan belajar dengan rajin dan sungguh sungguh terutama bahasa inggris, melatih kemampuan bahasa inggris dengan banyak mengikuti tes toefl, lalu mencari informasi mengenai beasiswa untuk studi di Luar negeri. selain itu mimpi terbesar saya adalah ingin menjadi seorang auditor di lembaga pemerintahan seperti BPK, cara mewujudkannyaa yaitu dapat dengan mendapatkan sertifikasi di bidang akuntansi yaitu CPA, CA, CFE dsb.',	'Ya, saya mempunyai pengalaman yang terkait dengan organisasi atau relawan, yang pertama yaitu menjadi Koordinator divisi dekorasi dan dokumentasi pada acara LKMM-TD yang diselenggarakan oleh Himpunan mahasiswa jurusan akuntansi, tugas saya adalah mengkoordinir anggota untuk mengerjakan tugasnya dengan baik dan benar selama acara berlangsung, saya juga mempunyai tugas yaitu mendesign, seperti design sertifikat, poster, PP Zoom, dan sebagainnya. pengalaman yang lain yaitu menjadi panitia di beberapa event kampus, seperti menjadi koordinator dekdok di entrepreuner expo, menjadi dekdok di accounting debate competition, buletin hima JA, dan islamic competition. tugas yang diberikan juga sama yaitu mendesign poster, feed ig, guideline, membuat logo, dsb. Relawan yang pernah saya lakukan yaitu relawan untuk corona, kegiatan tersebut yaitu melakukan edukasi ke lingkungan sekitar untuk menggunakan masker, cuci tangan dan menghindari kerumunan. ',	1,	1655739192,	NULL,	0),
('SCHLR-MHMMD-20f59c',	'USR-MHMMD-98bc9',	'Muhammad Ridha Akbar',	'2001-12-07',	'82240604006',	'Aceh Besar, Aceh.',	'Teknik Industri Fakultas Tekni',	'Universitas Syiah Kuala',	'3.06',	'4',	'Ambisius, percaya diri dan bertanggung jawab.\r\n3 hal tersebut menjadi landasan impian dan cara menjalani hidup. Suka mencoba berbagai kesempatan yang ada karena percaya bahwa kesempatan itu tidak akan datang dua kali. Selalu mencoba menjadi pribadi yang penuh tanggung jawab walaupun manusia penuh akan cela, tapi saya selalu mencoba yang terbaik. Saya melakukan yang terbaik dalam segala hal yang saya lakukan.',	'Memiliki perusahaan sendiri.\r\nSaya akan menjadi pemilik perusahaan dengan cara mengumpulkan orang orang berbakat yang saya rasa pantas untuk membersamai saya membangun sebuah perusahaan. Saya cukup merasa diri pandai dalam hal mengelola sumber daya manusia, dengan hal tersebut lah akan menjadi dasar saya membuat perusahaan.',	'Saya pernah menjadi ketua osis di SMA, dan untuk saat ini saya menjadi sekretaris umum di Himpunan Mahasiswa Teknik Industri Universitas Syiah Kuala. \r\nKetika saya menjadi ketua osis di sma tentu berbeda dengan sistem organisasi di kampus, di sekolah osis memiliki batasan untuk kegiatan dan pengelola sumber daya yang bisa saya kembangkan. akan tetapi di kampus dengan himpunan saya merasa lebih bisa memberi banyak manfaat untuk masyarakat luas. Mengelola sumber daya manusia di osis SMA dengan Himpunan Mahasiswa juga cukup berbeda, pada masa SMA banyak yang harus dibenahi, tidak ada pengalaman yang cukup dalam mengajak dan mengumpulkan masa. Sedangkan pada perkuliahan masa di organisasi cukup baik dan mempunyai pengalaman dalam bidang nya masing masing.',	1,	1655664777,	NULL,	0),
('SCHLR-MHMMD-4002c3',	'USR-MHMMD-c098e',	'Muhammad Sabiq Al-Khair',	'2001-09-19',	'82344036696',	'Jl. Pallantikang, Link. Buttatoa Utara, Kel. Pettuadae, Kec. Turikale, Kab. Maros, Prov. Sulawesi Selatan',	'Bimbingan dan penyuluhan Islam',	'UIN Alauddin Makassar',	'3.93',	'4',	'Saya Muhammad Sabiq Al-Khair. Saya sedang menempuh pendidikan S1 di UIN Alauddin Makassar. Pada jurusan Bimbingan dan penyuluhan Islam. Saya adalah seorang yang sangat gigih dalam menempuh perjalanan akademik karena saya mempunyai cita-cita untuk melanjutkan studi saya keluar negeri. Saya juga adalah seorang yang mempunyai jiwa leadership yg baik. Dan saya juga adalah seorang yang optimis, mampu bekerjasama baik itu individu maupun kelompok. ',	'Impian terbesar saya ialah ingin mejadi seorang Prof. Dr. Di bidang kesehatan mental. Lalu kemudian menjadi seorang dosen dan peneliti yg hebat. ',	'Yes. Of course. Saya mempunyai beberapa pengalaman organisasi dan dunia Kerelawanan.\r\n\r\n1. UKM RITMA UINAM (Unit Kegiatan Mahasiswa Riset, keilmuan dan kemitraan masyarakat) UIN Alauddin Makassar\r\n2. UKM LDK AL-JAMI\' (Unit Kegiatan Mahasiswa Lembaga Dakwah kampus Al-Jami\') UIN Alauddin Makassar\r\n3. ASSET (Association of Sulawesi Students)\r\n4. Abu darda Indonesia (Volunteer of humanity)\r\n5. Mentister Makassar (Volunteer of mental health) ',	1,	1654656795,	NULL,	0),
('SCHLR-MHMMD-48779c',	'USR-MHMMD-d6d98',	'Muhammad Nur Jadid ',	'2004-08-14',	'83831580902',	'Krai, Yosowilangun, Lumajang, Jawa Timur. 67382 ',	'Teknik Bioproses ',	'Universitas Brawijaya ',	'3.25',	'1',	'Halo, saya Muhammad Nur Jadid dan bisa dipanggil Jadid, mahasiswa semester 2 Teknik Bioproses Universitas Brawijaya yang aktif di keanggotaan Korps Sukarela (KSR) UB.  Merupakan seorang yang bertanggung jawab, teliti, kreatif dan inovatif, serta mampu memberikan energi positif dalam lingkungan. ',	'Sebagai seorang yang lahir dan besar di sebuah desa yang jauh dari kota, saya selalu bermimpi untuk dapat memajukan tempat dimana saya tumbuh, memakmurkan masyarakat sekitar dengan memberikan pekerjaan yang tetap kepada mereka. Melalui bangku pendidikan di Perguruan Tinggi  merupakan suatu upaya untuk menggapai impian tersebut. Satu yang saya pegang, \'kita adalah perpanjangan tangan tuhan untuk orang lain\', yang membuat saya terus semangat untuk menempuh pendidikan dan berkontribusi pada masyarakat. ',	'Iya, saya aktif dalam keanggotaan Korps Sukarela (KSR) UB yang bergerak di bidang sosial dan kesehatan, sebagai relawan pengajar di program MENGAJAR DESA, serta relawan SOWAN DESO 2022, merupakan sekian dari banyak pengalaman berharga saya dalam organisasi dan kerelawanan. ',	1,	1655694069,	NULL,	0),
('SCHLR-MHMMD-4b575a',	'USR-MHMMD-d4011',	'Muhammad Fauzan ',	'2004-03-28',	'82386446908',	'Jln. Soekarno Hatta, No.49, Kel.Padang Tinggi Piliang, Kec. Payakumbuh Barat, Kota Payakumbuh, Sumatera Barat',	'IPS',	'SMAN 2 PAYAKUMBUH ',	'2.91',	'6',	'Saya adalah seorang individu yang memiliki ketertarikan pada bidang seni, terutama seni musik. Saya pernah mencipta lagu, dan menurut saya lagu tersebut cukup bagus jika diciptakan oleh seorang pemula. Kemudian, saya adalah seorang pemimpin yang berjiwa besar, saya juga seorang teman yang ramah dan baik sehingga teman-teman saya suka berkawan dengan saya. Selain itu, saya juga memiliki kemampuan yang baik di bidang akademik, dan terakhir saya merupakan top 1 siswa eligible perankingan SNMPTN Tahun 2022.',	'Mimpi terbesar saya adalah ingin menjadi orang yang bisa menegakkan hukum di negara ini dengan sebaiknya-baiknya. Oleh sebab itu, saya akan menjadi seorang jaksa yang amanah dengan tugas sesuai dengan konstitusi. Saya akan bekerja dengan lurus untuk menegakkan hukum dengan adil dan tidak tajam ke bawah tumpul ke atas. \r\nCara saya adalah dengan belajar giat dan rajin karena saat ini saya menempuh pendidikan di bidang studi Hukum di salah satu universitas. Saya sangat bersemangat dalam mengejar mimpi tersebut.',	'Saya menjadi ketua ekstrakurikuler paduan suara di sekolah saya semasa SMA di tahun 2021 – 2022, saya merupakan ketua yang sangat baik menurut pembina saya. Saya berjiwa besar dan pandai membawa anggota ke arah yang lebih baik. Meskipun begitu, saya juga banyak merasakan tantangan mulai dari ketidakhadiran anggota, anggota yang keluar dari ekstrakurikuler dan juga lainnya. Namun, saya hadapi semua itu dengan tenang dan legowo.',	1,	1655354529,	NULL,	0),
('SCHLR-MHMMD-4c284b',	'USR-MHMMD-771db',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654014999,	NULL,	0),
('SCHLR-MHMMD-527c51',	'USR-MHMMD-a27e6',	'Muhammad Fathi Farhat',	'2002-07-01',	'85641554469',	'Jln. Alamanda B316 RT02/RW08 Perumahan Bukit Diponegoro, Kel. tembalang, Kec. Tembalang, Kota Semarang',	'Matematika/Matematika/Sains da',	'Universitas Diponegoro',	'3.51',	'4',	'Saya adalah orang yang antusias terhadap ide dan konsep. Saya selalu tertarik memikirkan cara memperbaiki suatu sistem yang ada di sekitar saya melalui inovasi-inovasi. Motivasi saya untuk menuai kebermanfaatan bagi sekitar merupakan penggerak saya dalam beraktivitas dan meningkatkan potensi diri.',	'Menjadi public speaker yang aktif menyampaikan gagasan dan pemikiran saya. Cara mewujudkannya adalah dengan mengembangkan diri melalui organisasi atau kepanitiaan yang sedang dijalani secara profesional dan bertanggung jawab, mengikuti berbagai kegiatan pengembangan diri, dan meningkatkan literasi.',	'Saya saat ini mengikuti dua organisasi intra kampus yaitu Himpunan Mahasiswa Matematika Undip dan Madani FSM Undip (sejenis rohis fakultas). Melalui kedua organisasi tersebut, saya mengikuti berbagai macam kepanitiaan dan banyak belajar dari sana, entah sebagai PJ, ketua divisi, hingga sekadar staff. Demi menciptakan suatu event yang maksimal dalam hal kuantitas dan kualitas, saya menganalisis kekurangan pada sistem dan mencari inovasi sebagai jalan keluar. Hasilnya, kemampuan public speaking hingga critical thinking pun dapat terasah.',	1,	1655685589,	NULL,	0),
('SCHLR-MHMMD-58c45d',	'USR-MHMMD-187f0',	'Muhammad Habbib',	'2002-05-03',	'89508632854',	'Panyalaian, Tanah datar, semutra barat',	'Teknik Kimia Fakultas Teknik',	'Universitas Sriwijaya',	'4',	'2',	'Perkenalkan nama saya Muhammad Habbib. saya sekarang berada di jurusan Teknik Kimia fakultas Teknik di kampus Universitas Sriwijaya. Saya orangnya kalau lagi kuliah itu jika ada tugas akan saya selesaikan secepatnya dan saya pahami karena saya tidak bukan tim deadliner. Menurut saya deadliner itu sangat merugi karena akan tergesa-gesa dan tidak ada waktu luang nantinya untuk ngecek apakah benar atau salah dari tugas kita buat. Tidak cuma tugas kuliah saya juga melakukannya pada saat berorganisasi di kuliah. Saya sangat suka orang yang bertanggung jawab dan tidak berbohong.',	'Mimpi terbesar saya, yaitu dapat mencapai IPK tinggi serta mendapatkan kemampuan softskill maupun hardskill yang tinggi seta relasi yang luas untuk menunjang kehidupan saya dikemudian hari. Oleh karena itu, saya ingin pergi ke belajar ke luar negeri. Cara mewujudkannya untuk sekarang saya mengikuti beberapa organisasi serta pelatihan-pelatihan serta beaasiswa seperti Beasiswa Pemuda by yang saya sangat harapkan dapat membantuk saya untuk itu ',	'Saya mengikuti beberapa organisasi di sma maupun pada saat kuliah sekarang ini. Pada saat sma saya mengikuti MPK, OSIS, Pramuka, dan Ketua Kaderisasi SMA. Pada saat kuliah ini saya tergabung ke Komunitas Sains Teknik tingkat fakultas, BEM FT, IMATEK tingkat  jurusan, U-read tingkat fakultas',	1,	1654065608,	NULL,	0),
('SCHLR-MHMMD-612532',	'USR-MHMMD-43172',	'Muhammad Ramadhan Aristyo',	'2002-12-03',	'81353896612',	'Gondang RT. 09/RW.03, Gondang, Kebonarum, Klaten',	'Pendidikan Teknik Mesin/Teknik',	'Universitas Negeri Yogyakarta',	'3.82',	'4',	'Nama Muhammad Ramadhan Aristyo, biasa dipanggil Ramadhan. \r\nMahasiswa semester 4 pendidikan teknik mesin dari Universitas Negeri yogyakarta. Saya anak pertama dari 2 bersaudara, riwayat pendidikan SDN 1 Gondang, SMP N 1 Jogonalan, SMAN 1 Jogonalan, dan Universitas Negeri Yogyakarta hingga sekarang. Kelebihan saya dapat bekerja secara kelompok, leadership, mudah menyesuaikan diri, saya dapat menggunakan software Microsoft Office, inventor, dan autocad. Hobi saya membaca, menulis, jogging, dan main catur. Motivasi mendaftar ingin meringankan beban orang tua akibat pandemi ekonomi sedang tidak baik baik saja karena orang tua sering diliburkan karena pabrik mau bangkrut, menjalin relasi, ingin belajar&mengembangkan diri bersama ybb foundation. ',	'Keinginan terbesar saya yang paling terdekat dapat menyelesaikan Sarjana dengan baik dan tepat waktu dan mendapatkan pekerjaan yang layak untuk mengangkat derajat orang tua. Cara saya mewujudkannya fokus untuk belajar, mengembangkan softskill, maupun hardskill, disiplin, bertanggung jawab dan yang paling penting adalah berdoa dan jujur. ',	'Waktu \r\nSMP:  Osis\r\nSMA: Pecinta Alam\r\nKuliah: UKM Catur, UKM KOPMA UNY\r\nSelain itu saya juga mengikuti beberapa kepanitian seperti ospek siswa, PKKMB Jurusan, Pendidikan Dasar, Pendidikan Lanjut, Panitia Seminar\r\n\r\n',	1,	1655716107,	NULL,	0),
('SCHLR-MHMMD-620ca5',	'USR-MHMMD-7000f',	'Muhammad Bukhori',	'2002-05-08',	'83867012478',	'Suru Lor 02/013 Hargomulyo Gedangsari Gunungkidul Yogyakarta',	'Desain Produk/ Fakultas Indust',	'Telkom University',	'3.78',	'1',	'Saya adalah seorang yang pendiam namun saya mempunyai jiwa yang kreatif dan inovatif. Saya juga mempunyai jiwa kepemimpinan dalam berorganisasi. Saya selalu berusaha untuk menjadi orang yang selalu berkembang dalam hidup saya. Namun, saya adalah salah satu orang yang belum beruntung dalam keluarga, ayah saya meninggalkan saya sejak saya masih berumur 1 bulan dan ibu saya meninggalkan saya sejak saya masih berumur 3 tahun. Saat ini saya tinggal bersama kakek saya dan paman saya. Namun kondisi ini tidak membuat saya menjadi putus asa untuk terus menggapai impian dan terus menganyam dunia pendidikan. Saya selalu berusaha dalam kehidupan saya dan saya selalu memohon kemudahan dan keberkahan kepada yang maha  kuasa. Agar kelak menjadi orang yang sukses dan bermanfaat.',	'\r\nMimpi terbesar saya yaitu saya ingin membangun sebuah bisnis yang mana bergerak di bidang food and beverage, namun juga terdapat sebuah karya-karya kreatif dari desain prodak, graphic design, dan dari karya-karya itu bukan fungsi yang menjadi prioritas namun estetika yang menjadi utama. Untuk cara mewujudkan nya saya mulai sekarang sudah membangun relasi dan bergabung di beberapa organisasi dan juga aktif mengikuti workshop yg berkaitan dengan design atau kreatifitas.disitulah saya berusaha menambah pengetahuan saya dan juga relasi saya, agar saya mempu berkembang dan mampunyai banyak pengalaman dan pengetahuan. Lalu d saat nanti saya rasa sudah siap dan mempunyai banyak bekal saya akan memulai untuk merancang dan memulai untuk mempersiapkan segala hal agar saya mampu menarik investor-investor dan partner yang mau bekerjasama dengan saya. Kemudian saya akan menyakinkan mereka agar semua berjalan dengan lancar. Namun, tak lupa saya akan terus berdoa dan meminta kemudahan dari yg maha kuasa. Semoga bisa tercapai aamiin',	'Iya.\r\nSaya mempunyai beberapa pengalaman dalam berorganisasi salah satunya saat saya masih SMP menjadi anggota OSIS dan saya pernah menjadi KA Div bidang Prestasi di organisasi pencak silat PSHT Gedangsari. Selain itu saya saat ini juga aktif mengikuti organisasi mahasiswa INDEC di kampus. Dan saat ini juga saya di beri tanggungjawab menjadi ketua Karang Taruna dusun suru Lor di desa saya.',	1,	1655457614,	NULL,	0),
('SCHLR-MHMMD-65a291',	'USR-MHMMD-9d2a3',	'Muhammad Syarif Fadillah ',	'2003-04-20',	'83873019294',	'Jln mutiara mas blok L9 no 68 kecamatan kota kabupaten Karawang ',	'Pendidikan jasmani kesehatan d',	'Universitas Singaperbangsa Kar',	'3.45',	'2',	'Saya Muhammad Syarif Fadillah,saya sangat senang dengan pendidikan, dan saya sangat senang menyukai olahraga, di dalam kehidupan saya sering melakukan kegiatan berorganisasi di sekolah maupun di universitas, saya menyukai organisasi sejak SMP di situ saya sempat menyalonkan sebagai ketua OSIS pada akhirnya gagal, tetapi saya di SMA bangkit dan Alhamdulillah saya menyalonkan tetapi hanya sebagai ketua bidang tetapi saya sangat bersyukur, di pendidikan saya begitu senang dengan mata pelajaran PPKN hingga sampai ke universitas, akan tetapi saya kuliah di jurusan PJKR ( PENDIDIKAN JASMANI KESEHATAN DAN REKREASI ), saya sangat bisa diandalkan saat berorganisasi, bermain bola, dll, tetapi kekurangan saya hanya di ekonomi saya, dengan kemampuan saya, saya bisa mencari pengalaman sehingga bisa menghasilkan uang dengan berolahraga dan berorganisasi sehingga di hidup saya akan saya tanamkan tentang ( prestasi ).',	'Mimpi terbesar saya yaitu berkiprah di dunia pemerintahan dan perpolitikan, saya sangat senang dengan mimpi terbesar saya, dengan mimpi terbesar saya ini ingin mewujudkan kesejahteraan masyarakat Indonesia, untuk cara saya mewujudkan nya yaitu mencari pengalaman di dunia perpolitikan dan berorganisasi di internal maupun di eksternal, dengan cara cara seperti ini saya mampu bisa mewujudkan mimpi terbesar saya yaitu berkiprah di pemerintahan dan perpolitikan. Terimakasih ',	'Pengalaman organisasi saya yaitu dari SMP,SMA, universitas, hingga eksternal, saat SMP saya mengikuti kegiatan OSIS disitu saya sempat menyalonkan sebagai ketua OSIS tetapi gagal saya hanya dapat sebagai anggota dan sekertaris, dan saya pernah menjadi relawan saat SMP, ditu saya mengikuti kegiatan PMR madya sehingga saya bisa mengikuti kegiatan relawan kesehatan masyarakat, saat SMA saya hanya mengikuti kegiatan OSIS disitu sempat menyalonkan sebagai ketua OSIS tetapi saya hanya dapat sebagai ketua bidang, dalam berorganisasi di SMA saya bisa dan sangat di andalkan saat pidato dan publik speaking , di universitas saat ini saya mengikuti kegiatan berorganisasi di himpunan mahasiswa, dalam organisasi yang saya duduki saat ini saya hanya sebagai anggota bidang relasi dan saya juga sedang menjabat satu program kerja yaitu podcast sebagai ketua pelaksana, target kedepannya saya insyaallah akan menyalonkan sebagai ketua umum himpunan mahasiswa PJKR, di eksternal saya sedang berusaha masuk ke PMII Karawang, dan kalau di lingkungan masyarakat rumah, saya mengikuti organisasi karang taruna,saya hanya sebagai anggota kesejahteraan masyarakat.',	1,	1654268461,	NULL,	0),
('SCHLR-MHMMD-706f59',	'USR-MHMMD-b1b04',	'Muhammad Mufid Musaddad',	'2001-01-15',	'895333353654',	'Tobratan Wirokerten Banguntapan Bantul Yogyakarta',	'Hukum Perbandingan Madzab',	'UIN Sunan Kalijaga',	'3.45',	'1',	'Saya Pribadi Yang Aktif Di Semua Lini Dan Saya Juga memanfaatkan kelas online saat pandemi juga ikut bantu orang tua mencari pekerjaan sampingan',	'Bermanfaat untuk semuanya baik manusia hewan alam semesta, caranya baik kepada sesama Ciptaan Nya',	'OSIS, Keamanan Pondok Pesantren, Himpunan Mahasiswa ',	1,	1654705055,	NULL,	0),
('SCHLR-MHMMD-84ec75',	'USR-MHMMD-acbf8',	'Muhammad Dahnil',	'2000-06-13',	'82298538485',	'Air Tawar Barat, Padang Utara, Kota Padang, Sumatera Barat',	'Bahasa dan sastra Inggris/ Pen',	'Universitas Negeri Padang',	'2.75',	'4',	'Nama saya Muhammad Dahnil biasa di panggil Dahnil. Saya berasal dari Mukomuko Bengkulu. Saya anak ke 2 dari 2 bersaudara. Saya sangat aktif mengikuti organisasi apalagi yang berbaur dengan alam. Saya sangat tertarik untuk belajar sesuatu hal yang baru. Saya mempunyai ayah seorang petani dan seorang ibu ibu rumah tangga. Dari bangku sekolah dasar sampai sekarang di bangku perkuliahan saya tidak pernah mendapatkan beasiswa dan bantuan dari pemerintah. Padahal keluarga say berasal dari kelas ekonomi menengah ke bawah.',	'Saya sangat ingin menjadi tenaga pendidik atau guru, kenapa karena saya ingin membantu murid murid saya nanti nya menggapai masa depan mereka. Saya berusaha belajar dengan baik sampai memuncaki hasil maksimal untuk menjadi tendik/guru.',	'Iya, dari bangku sekolah dasar sampai sekarang di perguruan tinggi saya masih aktif di Pramuka. Di sma saya di percayai sebagai ketua umum putra, dan di perguruan tinggi sekarang saya di percayai menjadi sekretaris umum putra Pramuka Universitas Negeri Padang. Selain Pramuka saya juga aktif di Badan Perwakilan mahasiswa (BPM) sebagai staf ahli Komisi A. Di sma saya juga mengikuti paskibra tingkat kecamatan 3 kali berturut-turut.',	1,	1655044733,	NULL,	0),
('SCHLR-MHMMD-8bab6c',	'USR-MHMMD-bc596',	'Muhammad Rizal',	'2000-06-05',	'89644044177',	'Jl. Kadir TKR, Tangga Buntung, Kelurahan 36 Ilir, Kecamatan Gandus, Kota Palembang',	'Ilmu Hubungan Internasional',	'Universitas Sriwijaya',	'3.87',	'7',	'Untuk pengalaman membaca yang lebih baik, mohon lihat jawaban saya melalui link berikut :)\r\n\r\nbit.ly/Rizal_YBB1',	'Untuk pengalaman membaca yang lebih baik, mohon lihat jawaban saya melalui link berikut :)\r\n\r\nbit.ly/Rizal_YBB1',	'Untuk pengalaman membaca yang lebih baik, berikut saya sertakan Curriculum Vitae saya (dan juga akun LinkedIn) untuk mengetahui pengalaman organisasi atau relawan yang telah saya lakukan :D\r\n\r\nhttps://bit.ly/Rizal_YBB3',	1,	1655739857,	NULL,	0),
('SCHLR-MHMMD-90f01d',	'USR-MHMMD-2f34e',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655139387,	NULL,	0),
('SCHLR-MHMMD-977089',	'USR-MHMMD-b3988',	'Muhammad Supriyanto',	'2003-10-27',	'85338906189',	'LINGKUNGAN GILIPANDA RT 13 RW 06 KELURAHAN SARAE KECAMATAN RASANAE BARAT KOTA BIMA NTB.',	'S1 GIJI',	'Universitas Muhammadiyah Bima',	'3.25',	'1',	'Nama saya Muhammad Supriyanto, Asal saya dari Kota Bima(NTB). Saya sedang menempuh pendidikan di Universitas Muhammadiyah Bima, dan mengambil jurusan Gizi, saya sangat suka belajar, menghafal, saya sangat aktif dalam berorganisasi salah satunya adalah IPM, saya sangat suka mengikuti berbagai macam olimpiade salah satunya adakah olimpiade ekonomi dan Matematika.',	'Mimpi terbesar saya menjadi seorang Dosen, cara mewujudkannya dengan cara melanjutkan pendidikan sampai jenjang S2/S3. Serta berusaha mendapatkan nilai bagus diatas rata-rata 3.00, dan semangat dalam belajar.',	'Iya, ketika saya berorganisasi banyak hal yang saya rasakan salah satunya adalah membuat diri saya menjadi lebih percaya diri. ',	1,	1653569048,	NULL,	0),
('SCHLR-MHMMD-9fc3f3',	'USR-MHMMD-b9826',	'Muhammad Sulthan Ramdhana',	'2002-11-22',	'85853217001',	'Dusun Trunosari nomor 3 RT 4 RW 5 Desa Klanting Kecamatan Sukodono Kabupaten Lumajang 67352',	'Fisika',	'Universitas Negeri Malang',	'3.72',	'2',	'Perkenalkan, nama saya Muhamamd Sulthan Ramdhana umur 19 tahun, saya anak pertama dari 3 saudara, berasal dari Kabupaten Lumajang yang saat ini sedang menempuh pendidikan di Universitas Negeri Malang semester 2. Hobi saya yaitu bermain futsal dan mengedit foto, saya juga tertarik akan temuan terhadap teknologi baru.',	'Mimpi tebesar saya yaitu bisa membuat yayasan kemanusiaan untuk membantu orang-orang, cara mewujudkannya mulai dari hal-hal kecil dengan membantu sesuai dengan kemampuan saat ini.',	'Iya, saya sewaktu SMA mengikuti OSIS yang mana menjadi ketua bidang, banyak pengalaman yang bisa didapatkan selama menjadi OSIS, salah satunya mengenai kerja sama dalam tim untuk menggapai suatu tujuan, selain itu juga bisa mengasa soft skill sesuai bidang saya pada teknologi.',	1,	1654526834,	NULL,	0),
('SCHLR-MHMMD-a32c55',	'USR-MHMMD-90ac4',	'Muhammad Farkhan Adhitama',	'2002-08-11',	'895338872182',	'RT/RW 12/VI, Desa Bojongminggir, Kecamatan Bojong, Kab. Pekalongan, Jawa Tengah',	'Informatika',	'Universitas Diponegoro Semaran',	'3.76',	'4',	'Saya Muhammad Farkhan Adhitama, mahasiswa program studi Informatika, Universitas Diponegoro Semarang. Saat ini, saya baru menyelesaikan semester 4 di jurusan Informatika. Sebelumnya saya adalah mahasiswa jurusan Arsitektur Universitas Diponegoro Semarang pada semester 1. Namun, Allah memiliki jalan lain karena saya memiliki kekurangan berupa buta warna parsial yang membuat saya harus pindah ke jurusan yang ditentukan yaitu jurusan yang saat ini saya geluti, Informatika. Walaupun berat, saya tetap berusaha sebaik mungkin pada program studi informatika ini, saya belajar hal-hal yang dibutuhkan pada program studi ini dari teman baru maupun dari internet. Walaupun terasa sedikit sulit, dengan belajar dengan baik, saya dapat menjalankan kuliah dengan baik. \r\n\r\nSaya adalah pribadi yang ambivert. Saya kurang percaya diri apabila bertemu dengan orang-orang baru. Namun, ketika saya sudah mengenal mereka, saya akan akrab sekali dengan mereka. Kepribadian ini membuat saya cenderung ragu untuk memulai pembicaraan dengan orang lain walaupun hati terasa ingin bicara terlebih dahulu. Untuk mengatasi masalah ini, saya mencoba untuk bergabung ke organisasi dan mengikuti kepanitiaan dan hasilnya cukup bagus bagi saya.\r\n\r\nWalaupun kuliah di program studi informatika, hobi saya yang sebenarnya adalah mendesain dan melukis. Saya pernah menjuarai beberapa lomba desain ketika saya masih SMA. Namun, saya cukup baik dalam melakukan coding jika saya berusaha dengan tekun  dan giat.',	'Mimpi saya terbesar saya adalah memadukan hobi saya yaitu desain dengan hal dasar pada program studi yang saya dalami yaitu coding. Hal tersebut adalah menjadi UI/UX designer pada perusahaan besar atau unicorn seperti tokopedia. Untuk mewujudkannya saya memulainya dengan belajar melakukan desain yang baik terlebih dahulu. Bagaimana warna dan bentuk yang baik dalam pendesainan UX/UI. Lalu, saya juga belajar front end developer untuk mengaplikasikan desain yang saya buat ke dalam sebuah web dengan mengikuti bootcamp coding maupun melihat youtube. Dalam belajar UI/UX, saya juga melihat referensi-referensi dari orang lain yang ahli. Saya juga ingin mengikuti kompetisi desain UI/UX agar saya dapat mengasah kemampuan dan melihat sampai mana saya berkembang.',	'Saya memiliki pengalaman organisasi dan kepanitiaan. Saya tergabung menjadi pengurus organisasi daerah pada Universitas Diponegoro yaitu KOMPAS UNDIP. Organisasi daerah ini menampung mahasiswa-mahasiswa dari daerah Pekalongan. Sekarang, saya menjabat sebagi kepala bidang Kantor Media dan Informasi. Dengan bergabung di Organisasi ini, saya dapat bertemu dengan teman-teman sedaerah yang berkuliah di UNDIP. Hal ini menjadikan saya tidak merasa sendiri karena banyak teman-teman sedaerah. Saya juga turut ikut berpartisipasi dalam pelaksanaan program kerja yang ada. Pelaksanaan kegiatan membuat saya lebih mengenal apa itu kerjasama dalam sebuah organisasi. Saya juga tergabung menjadi anggota Pimpinan Ranting IPNU desa Bojongminggir, Pekalongan. Kegiatan yang dilakukan di sini adalah rutinan pengajian kitab setiap malam jumat dan kegiatan-kegiatan amal lainnya. Dalam kepanitiaan saya pernah mengikuti beberapa kepanitiaan yang diselenggarakan oleh himpunan mahasiswa maupun fakultas. Kepanitiaan yang pernah saya ikuti antara lain panitia LKMMPD Informatika tahun 2021 dan Panitia POSITIF 2021. Saya biasa tergabung ke dalam divisi Desain dan Dokumentasi karena saya senang mengerjakan hal yang berbau desain.',	1,	1655714244,	NULL,	0),
('SCHLR-MHMMD-a821b9',	'USR-MHMMD-72881',	'Muhammad Abdurrahman Harits',	'2002-01-17',	'89670285971',	'Jalan Perdana Komplek bali Agung 2 Blok D no 11',	'Rekayasa Sistem Komputer Fakul',	'Universitas Tanjungpura',	'3.62',	'4',	'yang pertama saya lahir pada 17 januari 2002 di kota Pontianak provinsi Kalimantan barat pada saat ini saya telah menginjak umur 20 tahun, saya adalah anak pertama dari 2 bersaudara yang dimana adik saya sebagai anak kedua yang bernama Muhammad Iqbal, saat ini saya bertempat tinggal bersama orang tua di jalan perdana komplek bali agung 2 blok D no 11. SD dan SMPsaya di SD Negeri 12 Pontianak Selatan dan SMP Negeri 06 Pontianak Selatan, alhamdulilah saya dapat melanjutkan di Universitas Tanjung Pura Fakultas Matematika dan Ilmu Pengetahuan Alam (MIPA) Jurusan / Prodi Rekayasa Sistem Komputer, dan sekarang saya telah menginjak Semester 4, tidak terlepas dari kewajiban saya sebagai anak yg membawah amanah dari orang tua saya yg selalu berpesan bahwa “belajar lah dengan ikhlas dan selalu memberikan yg terbaik apapun yang terjadi karena yg terbaik hanya milik allah, dan selalu mengambil peluang yang anda yang mungkin berguna baik untuk saya maupun orang tua saya, serta tidak lupa untuk selalu memohon ampunan dari Allah subhanahu wa ta\'ala telah memberikan segala nikmat dan karunianya kepada kita, sehingga sampai pada detik ini masih bisa merasakan nikmat sehat”.\r\n        Hobi saya sekarang adalah melakukan sesuatu hal yg berkaitan dengan desain grafis, videography, photography, dan 3d desain karena saya menyukai sesuatu hal-hal yang berkaitan dengan kerandoman suatu warna, bentuk yang abstrack serta memiliki fungsi dan nilai yang memiliki makna yang tersembunyi. Motto hidup saya adalah selalu memberikan yang terbaik karena jika kita melakukan sesuatu dengan penuh dedikasi dan tanggung jawab insya allah, allah akan memberikan jalan yang terbaik sesuai kehendaknya, serta jika kita melakukan sesuatu dengan terbaik maka disitu juga kita bisa belajar gimana untuk dapat memaksimalkan suatu pekerjaan dengan maksimal.\r\n           Saya Orangnya Mudah Bergaul, dan bisa bergaul dengan siapa saja yang mau berteman dengan saya, selama orang itu akan memperlakukan saya dengan baik juga, namun jika orang itu tidak baik dalam memperlakukan saya, saya akan berusaha membatasi pergaulan dengan dia kepada saya, saya adalah orang yang suka mempelajari hal sesuatu yang belum diketahui oleh saya atau keahlian apa yang belum ada pada diri saya , dan saya ingin mempelajari hal tersebut. Selain itu saya juga selalu berusaha untuk mengikuti segala sesuatu kegiatan baik itu akademik maupun non akademi dikarenakan saya suka berteman dengan orang baru dari berbagai latar belakang  sebab saya orangnya suka mendegarkan cerita-cerita dari banyak teman yang dimana saling bertukar pikiran akan suatu pendapat.\r\n',	'mimpi terbesar saya adalah untuk bisa menjadi orang yg bisa memberi manfaat kepada orang lain baik itu ilmu ataupun polar pikir yang maju dari cara memulai langkah kecil yaitu dengan memperbanyak ilmu di dalam diri dengan produktif sehingga apapun yang dilakukan dapat memberi manfaat bagi diri sendiri dan orang lain seperti saya meluangkan waktu saya setiap selesai kuliah dengan belajar fundamental dan dasar-dasar desain grafis dan bisnis untuk menjadi pondasi saya mencapai orang yang sukses di karier saya ',	'Dan pada saat ini saya telah mengikuti beberapa organisasi yang telah saya ikuti untuk sekarang ini yaitu Artlaboratory yang sekarang ini berada di divisi multimedia yang berperan dalam pengaplikasian videography, photography dan desain grafis, Mentor Pendikar Pancasila Untan yang bertugas untuk membimbing dan membina para mahasiswa baru untuk mengembangkan dan meningkatkan perilaku mahasiswa agar tercipta mahasiswa yang beriman, berwatak mulia serta memiliki pribadi yang berintegritas serta religius  dan Himaster sebagai wadah bagi mahasiswa untuk dapat mengembangkan perilaku yg disiplin dan berkarakter yg memiliki tanggung jawab dan dedikasi tinggi. serta AIESEC in Untan sebagai Specialist Marketing Staff yang bertugas untuk memperkenalkan atau mempromosikan setiap produk yg ada di AIESEC in Untan sehingga diharapakan Konsumen dapat tertarik dengan Produk yang ditawarkan, juga meriset serta pengembangan untuk menyampaikan manfaat yang dapat konsumen dapatkan dari produk yang promosikan. disamping itu juga melacak tren dan memantau persaingan serta membangun branding terkait perubahan dalam media promosi agar produk yang ditawarkan dapat di menjangkau berbagai lapisan masyarakat.',	1,	1654766908,	NULL,	0),
('SCHLR-MHMMD-aaa808',	'USR-MHMMD-3363f',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654657143,	NULL,	0),
('SCHLR-MHMMD-b6fff6',	'USR-MHMMD-7f9c3',	'Muhammad Danil',	'2003-03-16',	'82178170095',	'Jl.ki kemas rindo kertapati palembang',	'Farmasi',	'Universitas Sriwijaya',	'3.98',	'2',	'Hidup bagaikan tangga, itulah motto hidup yang selalu saya pegang sampai sekarang. Menapakkan kaki langkah demi langkah naiklah dengan santai tetapi tetap fokus karena dalam menaiki tangga tersebut, kita harus tetap memilih tangga yang baik sesuai dengan arah tujuan kita. Anggap kegagalanmu hanyalah anak tangga yang patah walaupun sulit tapi dapat dihadapi. Nama saya Muhammad Danil, saya gemar menonton film, memiliki hewan peliharaan, dan  jalan-jalan menemukan insight dan sudut pandang baru. Saya lahir di Palembang, 16 Maret 2003 saat ini saya berkuliah di universitas sriwijaya fakultas matematika dan ilmu pengetahuan alam program studi farmasi. Saya memiliki semangat pemimpin, bersikap sebagai penengah di masa sekolah saya sering ditunjuk sebagai pemimpin dan pengevaluasi dalam kegiatan acara-acara penting disekolah, saya juga tanggap dengan keadaan dimana saya harus pintar menempatkan diri di berbagai macam situasi, dan menghormati pendapat orang lain. Saya menyukai kerapian, kebersihan, dan mengorganisir sesuatu karena hal tersebut dapat membuat saya menjadi produktif dan membuat fisik lebih semangat dalam bekerja. Saya juga memiliki kepribadian ambivert yaitu tipe kepribadian yang merupakan gabungan dari kepribadian introvert dan ekstrovert, saya menikmati saat sedang berada pada situasi sosial berkumpul dengan orang-orang dan kegiatan organisasi, layaknya orang dengan kepribadian ekstrovert. Namun, di sisi lain, saya juga mengamati secara detail,berhati-hati dalam bertindak, dan mengamati sesuatu hal dengan baik layaknya seorang introvert Orang dengan kepribadian ambivert cenderung lebih fleksibel dalam menghadapi berbagai situasi. Adapun , kelemahan yang saya miliki saya terlalu fokus pada detail karena hal tersebut saya biasanya melakukan double checking sebelum mengumpulkan tugas yang saya kerjakan, dan  saya terlalu cemas memikirkan tentang masa depan. Akibatnya saya sering membuat planning yang berlebihan untuk mengatasi hal tersebut saya belajar untuk menyusun rencana lebih kompleks, dibuat secukupnya, dan lebih banyak bertindak',	'Mimpi terbesar saya adalah mampu mematahkan roda kehidupan yang terus berlanjut dari zaman dahulu. saya berkeinginan kuat untuk lulus pendidikan setinggi mungkin bekerja dibidang yang saya sukai dan tekuni, berkeliling dunia menemukan hal-hal yang baru, dan  mampu menghasilkan kontribusi besar bagi negara. Jika saya berhasil mematahkan roda kehidupan tersebut secara otomatis apa yang saya lakukan akan terus berlanjut di generasi selanjutnya dan saya harap bisa melampaui saya dan bisa menghasilkan ide-ide baru terbaik bagi kesejahteraan bangsa',	'Dimasa SMA saya juga aktif di berbagai kegiatan organisasi dan ekstrakurikuler saya ditunjuk sebagai ketua science club, ketua divisi event organizer OSIS, wakil ketua olimpiade club, dan wakil ketua kelas. Berkat kecakapan saya dalam berkomunikasi dan kerja sama yang baik. Saya juga sering diajak oleh guru untuk mempromosikan SMA saya ke Sekolah Menengah Pertama yang ada di kota Palembang.   Saya aktif mengikuti konferensi International Model United Nations. Berupa platform simulasi sidang Perserikatan Bangsa-Bangsa(PBB) yang diikuti pelajar di seluruh dunia dan telah disponsori dan didukung oleh organisasi khusus PBB seperti UNDP, UNESCO, IOM serta oleh Kedutaan Besar Australia di Vietnam & Thailand). Saya memilih komite WHO BAHASA dengan tema: “Rencana Tindakan Kesehatan Mental: Promosi Pelayanan dan Pengobatan”. Selanjutnya, saya juga ikut serta dalam program magang duta kampus International Model United Nations (IMUN) selama 5 minggu. Yang bertugas mempromosikan konferensi online IMUN, membantu dalam mendorong orang-orang melakukan pendaftaran untuk konferensi online, memberi informasi bagaimana IMUN memainkan peran penting dalam mempelajari berbagai keterampilan seperti negoisasi, diplomasi, dan kepemimpinan.  Saya bergabung dengan komunitas lokal di kota Palembang yaitu komunitas Palembang Peduli Hewan (PPH). Alasan saya bergabung karena hampir setiap hari saya selalu bertemu hewan yang terlantar, tidak terawat, dan kelaparan terutama di daerah pasar. Dengan berada di komunitas ini saya bertemu dengan orang yang sama pedulinya dengan hewan. Kami juga membuat akun social media untuk teman-teman yang tidak bisa bergabung secara langsung kami selalu membuka komentar untuk laporan mengenai daerah banyak hewan yang tidak diberi makan contohnya Taman Patra Jaya Palembang dan Punti Kayu Palembang disana banyak hewan khususnya monyet. Kami juga membuka donasi untuk hewan yang terluka akibat kecelakaan dan lain-lain. Pandangan masyarakat terhadap komunitas ini terbilang kurang tertarik dan buang waktu. Akan tetapi, dengan seiring berjalannya waktu masyarakat mulai menerima dan ikut mensosialisasikan gerakan Palembang Peduli Hewan (PPH). dan baru-baru ini saya ditunjuk menjadi wakil penangung jawab kegiatan Pesta Ilmiah Sriwijaya yang merupakan kegiatan perlombaan terbesar seluruh indonesia yang diadakan UKM U-READ universitas sriwijaya',	1,	1654175623,	NULL,	0),
('SCHLR-MHMMD-b86131',	'USR-MHMMD-f449e',	'Muhammad Amru Ashodiki',	'2002-03-06',	'81233030671',	'Jln kyai Tamin gang 5 no 42 RT 1 RW 7 ',	'Pendidikan Jasmani Kesehatan d',	'IKIP Budi Utomo malang ',	'4.00',	'2',	'Saya adalah mahasiswa semester 2 yang ingin sekali meningkatkan skill dan kualitas saya agar dapat membantu di masa depan ',	'Ingin membuka lowongan kerja,saya ingin memulai bisnis pribadi saya',	'Saya pernah bergabung dalam organisasi Dewan Galang dan juga relawan di salah satu pesantren di malang',	1,	1653768623,	NULL,	0),
('SCHLR-MHMMD-bc58a6',	'USR-MHMMD-b3988',	'Muhammad Supriyanto',	'2003-10-27',	'85338906188',	'LINGKUNGAN GILIPANDA, RT 13, RW 06, KELURAHAN SARAE, KECAMATAN RASANAE BARAT, KOTA BIMA (NTB).',	'S1 GIJI',	'Universitas Muhammadiyah Bima',	'3.20',	'1',	'Perkenalkan nama saya Muhammad Supriyanto, Asal daerah Kota Bima (NTB), ',	'Mimpi terbesar saya adalah menjadi seorang Dosen, Cara mewujudkan dengan cara melanjutkan pendidikan sampai jenjang S2/S3, menjadi seorang Dosen tidaklah mudah, dikarenakan harus giat belajar, tidak mudah menyerah dan semangat dalam belajar.',	'Iya, Organisasi yang saya jalani sekarang adalah IPM(IKATAN MAHASISWA MUHAMMADIYAH), Banyak pelajar yang saya ambil ketika saya berorganisasi mulai dari memberikan pendapat dan menyatukan opini, banyak sekali hal2 yang merubah kepribadian saya ketika ber organisasi mulai dari waktu, yang tdk boleh telat dalam berorganisasi, mulai dari kepercayaan teman\" kepada tim, banyak sekali kegiatan yang mengubah pandangan sekolah, yang dulu sekolah tidak memiliki berbagai macam tanaman sekarang dipenuhi tamanan, dan memberikan sedekah kepada masyarakat kurang mampu.',	1,	1653563168,	NULL,	0),
('SCHLR-MHMMD-bd8caf',	'USR-MHMMD-2e36c',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655739405,	NULL,	0),
('SCHLR-MHMMD-c0d9f5',	'USR-MHMMD-4aa66',	'MOHAMMAD BINTANG RIZQI PRATAMA',	'2002-03-21',	'895414646470',	'JL. MUJAIR 3 /12, TUNJUNGSEKAR, LOWOKWARU, KOTA MALANG, JAWA TIMUR',	'TEKNIK MESIN PRODUKSI DAN PERA',	'POLITEKNIK NEGERI MALANG',	'3.74',	'4',	'Saya Mohammad Bintang Rizqi Pratama, adalah seorang anak tunggal. Ayah dan ibu saya sudah bercerai sejak saya berumur 2 tahun. Selama 18 tahun, saya bersama ibu kandung tinggal di rumah nenek yang terletak di Kota Malang. \r\n\r\nSaya bersekolah di SDN Tunjungsekar 5, SMPN 6 Malang, SMAN 4 Malang, dan kini sedang melanjutkan studi di Politeknik Negeri Malang. Selain berkuliah, saya juga aktif berorganisasi. Organisasi yang saya ikuti adalah UKM Usaha Mahasiswa yang bergerak di bidang kewirausahaan. \r\n\r\nSelain itu, saya juga mengikuti kegiatan kemahasiswaan yang lain seperti PKM, dan juga Lomba Karya Tulis Ilmiah. Saya pernah menjuarai Lomba Karya Tulis Ilmiah \"BINANGA\" yang diadakan oleh Fakultas Teknik Universitas Hasanuddin pada bulan Mei 2022.',	'Mimpi terbesar saya adalah membahagiakan kedua orang tua saya, dengan cara menuntut ilmu sebaik mungkin dan berbakti kepada orang tua.',	'Saya  mengikuti UKM Usaha Mahasiswa Politeknik Negeri Malang. UKM yang saya ikuti ini bergerak di bidang kewirausahaan. Untuk periode 2022-2023 ini, saya menjabat sebagai Kepala Bagian Operasional yang mengatur semua kegiatan operasional seperti menjual makanan, minuman, seragam praktik, kaos, dan merchandise yang lain.\r\n\r\n',	1,	1654410220,	NULL,	0),
('SCHLR-MHMMD-c9aef0',	'USR-MHMMD-04678',	'Muhammad Rayhansyah Putra Setiawan',	'2002-09-23',	'82238119378',	'Jl. Poncowati, Kota Sorong, Papua Barat',	'Teknik Kimia Fakultas Teknik',	'Universitas Sebelas Maret Sura',	'3.64',	'3',	'Assalamualaikum warahmatullahi wabarakatuh, Perkenalkan saya Muhammad Rayhansyah Putra Setiawan asal dari Sorong, Papua Barat. Saya saat ini sedang menepuh pendidikan S1 di Universitas Sebelas Maret Surakarta. Berikut adalah beberapa hal yang dapat saya ceritakan mengenai diri saya sendiri. Saya adalah orang yang percaya diri, mampu bekerja dalam tim serta bertanggung jawab atas amanah dan tugas yang diberikan. Saya adalah orang yang memiliki rasa penasaran tinggi baik dalam ilmu pengetahuan maupun dalam kehidupan bermasyarakat. Saya adalah orang yang sangat menyayangi orang tua dan orang-orang terdekat saya, ini juga salah satu alasan saya mencari beasiswa agar meringankan beban kedua orang tua saya. Kekurangan saya adalah terkadang menunda suatu pekerjaan yang mengakibatkan rencana yang susun berantakan. Terima kasih',	'Mimpi terbesar saya selama hidup saya saat ini adalah menaikan haji kedua orang tua, serta dapat menafkahi mereka tanpa mereka perlu bekerja lagi. Saya merasa melihat mereka yang bekerja terlalu keras membuat saya sakit hati dan ingin membuat saya yang menafkahi mereka agar hidup bahagia di hari tua mereka nanti. Aamiin',	'Saya memiliki pengalaman organisasi di Himpunan Mahasiswa Teknik Kimia Universitas Sebelas Maret Surakarta. Disini saya diajarkan bagaimana bekerja dalam suatu tim, bagaimana cara menghadapi wawancara, bagaimana cara menghadapi masyarakat umum, bahkan ikut membantu mengembangka desa di Indonesia ini. Menurut saya organisasi ini sangat bagus buat saya mengembangkan baik software maupun hardware dari saya yang nantinya bisa saya gunakan di jenjang kehidupan selanjutnya.',	1,	1653919610,	NULL,	0),
('SCHLR-MHMMD-cf25e1',	'USR-MHMMD-6ffa5',	'muhammad rismin',	'2002-01-19',	'85279630182',	'kota kendari jalan banteng',	'teknik elektro',	'universitas haluoleo',	'2.7',	'4',	'Saya Muhammad Rismin, mahasiswa Universitas Haluoleo pada jurusan Teknik Elektro dengan konsentrasi ilmu arus lemah elektronika dan komputasi. Saat ini sya menempuh jenjang Pendidikan Sarjana pada semester 4 (2020- sekarang). Selama saya berkuliah saya aktif dalam kegiatan kepenulisah, Program Kreatifitas Mahasiswa (PKM), kegiatan riset dan penelitian serta tim robotic, selain itu juga saya aktif dalam organisasi perhimpunan mahasiswa. Saya memiliki minat berkarir sebagai software developer',	'mimpi terbesar saya adalah menciptkan start up yang bisa bekerja sama bersama desa sya agar kehidupan didesa saya bisa berubbah bukan hanya keluarga melainkan masyarakat di desa saya',	'sampai saat ini saya terus belajar dan ikut masuk dalam organisasi perhimpunan mahasiswa di daerah saya serta sampai saat ini saya masih berjuang untuk mewujudkan startup yang saya ingin dirikan melalui program kreatifitas mahasiswa ',	1,	1655658793,	NULL,	0),
('SCHLR-MHMMD-d2b6ac',	'USR-MHMMD-31151',	'Muhammad Imam Al-Gazali',	'2002-10-16',	'81356564041',	'Jl. Flamboyan Barat No. 66, RT 3, RW 2, Kel. Mattoangin, Kec. Mariso, Kota Makassar, Prov. Sulawesi Selatan, 90121',	'Ilmu Hadis',	'Universitas Islam Negeri Alaud',	'3.90',	'4',	'Saya adalah seorang anak laki-laki bungsu dari 3 bersaudara, Saya lahir dari keluarga yang sangat sederhana, Ayah saya bekerja sebagai Kuli Bangunan harian yang gaji nya hanya cukup untuk makan sehari-hari kami, sedangkan Ibu saya seorang Ibu Rumah Tangga, saya memiliki 2 orang saudara perempuan yang telah menyelesaikan Studi S1 nya dengan biaya sendiri dan juga beasiswa, sedangkan saya masih menjalani studi S1 saya dengan biaya sendiri juga, saya bekerja sebagai guru ngaji, menerima jasa editing dan menjual pulsa untuk mencukupi kebutuhan biaya kuliah dan sehari-hari, dan saya bertekad untuk segera menyelesaikan studi S1 saya lalu melanjutkan Studi S2 untuk menjadi dosen.',	'Mimpi terbesar dalam hidup saya ada 2, Pertama yaitu saya ingin menjadi seorang dosen, dan yang kedua saya ingin memberangkatkan kedua orang tua saya untuk Haji.\r\n\r\nSaya sedang menempuh pendidikan S1 dan tersisa 2 tahun, setelah lulus saya ingin mencari pekerjaan sampingan lalu melanjutkan studi S2 saya agar bisa menjadi seorang dosen.\r\nSetelah menjadi dosen saya akan menabung sebagian dari gaji saya untuk tabungan keberangkatan haji kedua orang tua saya.',	'Saya merupakan mahasiswa yang termasuk aktif di dalam berorganisasi dan menjadi relawan. Di Kampus saya juga mengemban amanah menjadi Seorang Ketua Tingkat dan itu merupakan hal yang luar biasa bagi kehidupan saya, karena dapat di percaya untuk menjadi ketua di dalam kelas. \r\nDi Perkuliahan saya mengikuti 2 Organisasi, yang pertama yaitu HMJ (Himpunan Mahasiswa Jurusan) dan menjadi anggota Devisi Dakwah dan Kerohanian, dalam devisi tersebut saya mengasah skill yang saya miliki terutama dalam skill mengajar, dimana salah satu program kerja kami yaitu untuk membuat jurusan mengajar dan yang kami ajar yaitu anak-anak jalanan,panti dan lainnya yang membutuhkan pendidikan.\r\nYang kedua saya memasuki LDF (Lembaga Dakwah Fakultas) dan mengemban amanah menjadi sekretaris umum, organisasi ini merupakan organisasi bernuansa Islami, oleh karena itu sangat berhubungan dangan Agama Islam, satu hal yang sangat berharga dan berarti bagi saya yaitu ketika saya dipercaya untuk menjadi relawan dalam membimbing senior-senior saya untuk menghafal Al-Qur’an Juz 30 agar bisa mengikuti Ujian Skripsi.',	1,	1654058708,	NULL,	0),
('SCHLR-MHMMD-df0a1b',	'USR-MHMMD-babd8',	'Muhammad Qadri Ramadhan',	'2003-11-13',	'81329999814',	'Jl. Pulo Macan Raya No. 1A',	'Islamic Studies',	'Universitas Muhammadiyah Surak',	'3.40',	'2',	'Saya adalah pemuda yang mempunyai semangat tinggi dalam mengembangkan hal sosial, seperti seni berkomunikasi dan design grafis. Saya tumbuh dengan rasa percaya diri bahwa setiap pemuda mempunyai kesempatan yang luas untuk bisa memperbaiki diri dahulu baru memperbaiki serta bermanfaat bagi masyarakat luas.',	'Pada umur 25, saya mempunyai target untuk membangun Sports Center, dilatarbelakangi oleh pelbagai permasalahan remaja yang terjadi saat ini, dengan bijak bisa dikatakan, remaja tidak bisa dilarang untuk bermasalah, namun bisa dialihkan kepada program yang lebih bermanfaat.',	'Iya saya mempunyai pengalaman organisasi nasional, pada tahun 2018 saya pun mengikuti wawasan kebangsaan, pada tahun 2019 saya mengikuti dan menerima pertukaran pelajar, pada tahun 2020 saya menjadi perwakilan daerah untuk lomba futsal di tingkat provinsi, pada tahun 2021 saya menjadi project leader dalam annual yearbook.',	1,	1655742595,	NULL,	0),
('SCHLR-MHMMD-e38e44',	'USR-MHMMD-116d8',	'Muhammad Firdaus ',	'2003-09-18',	'89636465140',	'Jalan Sulaiman (Gang Damai) No.20, RT. 08/RW. 03, Kel. Sukabumi Utara, Kec. Kebon Jeruk, Kota Jakarta Barat, DKI Jakarta, 11540.',	'Multimedia ',	'SMK Negeri 45 Jakarta ',	'3.81',	'4',	'Perkenalkan saya Muhammad Firdaus. Saya siswa jurusan Multimedia di SMK N 45 Jakarta. Sewaktu kelas 6 saya pernah menjadi pembimbing untuk pelajaran matematika kepada teman-teman dan adik kelas saya. \r\n\r\nSaat SMP, saya juga menjadi pembimbing teman sebaya untuk mengajarkan pelajaran pelajaran yang akan ada pada ujian nasional.\r\n\r\nPada saat ini saya aktif dan menjadi ketua dalam organisasi rohani islam. Saya sudah melakukan Praktik Kerja Lapangan untuk memenuhi kriteria penilaian Sekolah.\r\n\r\nHarapannya, dengan pengalaman pengalaman tersebut saya bisa mengikuti beasiswa YBB untuk mengetahui lebih jauh potensi diri saya sendiri.',	'Mimpi terbesar saya untuk saat ini adalah lulus dengan nilai yang memuaskan dan dapat melanjutkan kuliah ke luar negeri untuk melanjutkan pendidikan dengan mendapatkan beasiswa.\r\nCara saya untuk mewujudkannya pada saat ini adalah giat belajar dan usaha untuk mencari berbagai beasiswa untuk kuliah nanti.',	'Pengalaman berorganisasi saya saat ini adalah menjadi ketua dalam organisasi rohani islam. Sebagai ketua saya mengatur dan melaksanakan program kerja yang ada pada organisasi yang saya pimpin. Dengan menjadi ketua, banyak kendala dan hambatan yang ada tetapi juga ada pendukung saya seperti anggota anggota dan pengurus organisasi. Menurut saya berorganisasi sangat penting untuk melatih diri kita sendiri dekat dengan orang lain dan menambah relasi menjadi lebih luas.',	1,	1655502408,	NULL,	0),
('SCHLR-MHMMD-eab69a',	'USR-MHMMD-fdd1a',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655636369,	NULL,	0),
('SCHLR-MHMMD-f015dd',	'USR-MHMMD-d2df4',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654350470,	NULL,	0),
('SCHLR-MHNTN-d38ada',	'USR-MHNTN-4eb8f',	'Moh Anton ',	'2000-12-27',	'89520838362',	'Kecamatan Bangsalsari, Kabupaten Jember, Provinsi Jawa Timur, Indonesia ',	'Manajemen Dakwah/Dakwah',	'Universitas Islam Negeri Kiai ',	'3.87',	'2',	'Bismillahirrahmanirrahim,\r\nSaya adalah seorang Mahasiswa di salah satu kampus keislaman di daerah Jember ( UIN KHAS Jember ). Hari ini saya hampir menyelesaikan semester 2 dalam berkuliah. Saya juga tipe orang yang suka berorganisasi dan aktif dalam masalah akademik terkhusus pada mata kuliah saya di kelas. Selain itu saya juga memiliki jiwa enterpreneur yang sedang berusaha saya kembangkan. ',	'Sampai hari ini, mimpi terbesar saya adalah menjadi pemimpin di desa saya. Sebab saya yakin bahwa membangun negeri harus di mulai dari bawah. Saya bercita-cita menjadi pemimpin negeri dengan belajar dari bawah, memperbaiki dari bawah, dan konsisten dari bawah agar mampu menganalisa masalah secara mendalam. Cara saya mewujudkan cita cita saya adalah dengan belajar dan mengaplikasikan hasilnya pada diri saya, seperti bagaimana cara saya memecahkan masalah, cara saya memimpin organisasi di kampus, dan cara saya bersosialisasi di kampus serta semangat belajar saya selama berkuliah. ',	'Saya terbilang anak organisasi, sejak SD saya mengikuti Pramuka, SMP dan SMA sebagai anggota OSIS dan di bangku kuliah ini saya juga ikut organisasi PMII yang fungsinya adalah mengawasi kondisi daerah Jember, sebab mahasiswa tidak hanya belajar akan tetapi berpikir untuk memajukan daerahnya juga. ',	1,	1654501209,	NULL,	0),
('SCHLR-MHRDK-4f738e',	'USR-MHRDK-a4af6',	'Mahardika Agustina',	'2003-08-16',	'83824432544',	'Jl. Smp 1 Cilimus No.6 Rt.15/Rw.05 Dusun Pon Desa Bojong Kec.Cilimus Kab.Kuningan 45556',	'Sistem Telekomunikasi',	'Universitas Pendidikan Indones',	'3.70',	'1',	'Nama Saya Mahardika Agustina dipanggil Dika, saat ini sedang menempuh pendidikan di bangku kuliah semester 2 dan aktif mengikuti organisasi tingkat prodi/jurusan. Saya seorang yang suka bertanggung jawab terhadap suatu hal seperti pada saat ini mengikuti organisasi harus bertanggung jawab terhadapat tugas yang diterima dan tidak melupakan kewajibannya sebagai seorang mahasiswa yang sedang mencari ilmu untuk selalu aktif pada saat kuliah, selain itu saya orang yang peka terhadap sekitar seperti saya harus mengawali diskusi kelompok, membantu teman, dan suka berimajinasi tentang kehidupan disekitar saya yang dapat membuat saya ingin untuk merealisasikannya',	'mimpi terbesar saya adalah membuka lapangan pekerjaan, saya berpikir bahwa untuk mewujudkannya perlu relasi yang banyak dan beragam. kenapa demikian karena latar belakang saya yang sekarang bukan berasal dari jurusan bisnis/sosial memerlukan masukan dan tukar pikiran dari orang-orang hebat dibidangnya untuk bisa menghasilkan ide-ide yang dapat mewujudkan mimpi saya',	'saya pernah aktif OSIS SMP, Remaja Masjid di Desa, dan sekarang mengikuti organisasi di tingkat jurusan/prodi. pengalaman yang saya dapat setiap kali mengikuti organisasi adalah keberagaman sikap individu yang harus di hargai dan kita harus berpikir kritis terhadap permasalahan yang ada atau untuk menghasilkan ide-ide baru. Skill juga pastinya didapatkan seperti percaya diri untuk berbicara didepan banyak orang, dapat membuat design menggunakan software untuk program kerja yang dilaksanakan dan manajemen waktu untuk mencapai goals yang ditentukan',	1,	1655729895,	NULL,	0),
('SCHLR-MHRFL-f07983',	'USR-MHRFL-08782',	'MUH RIFLI',	'2002-11-26',	'81342354647',	'Wonomulyo, Polewali Mandar, Sulawesi Barat',	'Biologi',	'Universitas Terbuka',	'3.19',	'2',	'Perkenalkan nama saya MUH RIFLI. Kelebihan saya adalah saya mampu berkerja sama dalam team dan mampu mengatur waktu serta ulet tetali sebagai manusia biasa saya punya kekurangan yaitu orang yang mudah merasa puas.',	'Mimpi terbesar saya adalah menjadi yang bermanfaat bagi orang lain dan cara saya mewujudkanya dengan cara rajib belajar',	'Saya mempunyai pengalamn oragnisasi yaitu pernah sebagai oerwakilan Sulselbar dalam acara volunter di Malino dan juga menjadi anggita bangun bangsa Sulawesi barat',	1,	1653533513,	NULL,	0),
('SCHLR-MHRMS-22d372',	'USR-MHRMS-af214',	'Muharami Aisyah Hanafi',	'2002-03-22',	'85890670559',	'Jakarta, Indonesia.',	'Ilmu Pendidikan Agama Islam',	'Universitas Pendidikan Indones',	'3.79',	'2',	'aku adalah seorang yang memiliki ambisi dan semangat untuk mencapai segala keinginan. aku juga akan bersungguh-sungguh terhadap apa yang aku jalani, kuliah misalnya, juga segala kegiatan yang aku ikuti di luar perkuliahan, aku memiliki minat di bidang memasak, menulis, juga bereksplorasi di bidang apapun. di sela kesibukan aku suka melakukan hobi-hobi tersebut, seperti memasak, aku akan terus mencoba segala resep yang belum aku pernah buat juga menulis, aku suka mengarang dan menyampaikan perasaan melalui tulisan, nah, begitu pula dengan bereksplorasi, dalam hal ini aku suka sekali mencari hal-hal yang belum pernah aku temui sebelumnya, entah itu dalam kreasi keterampilan, berjelajah, maupun ilmu yang lainnya, yang pasti dapat membuatku terinovasi.',	'mimpi terbesarku adalah bisa menggapai cita-citaku yaitu menjadi guru, penulis, dan juga pemilik toko kue, karena ketika aku dapat mewujudkan cita-citaku, aku akan dapat membuat orang tua serta keluargaku bangga dan bahagia. untuk mewujudkannya aku harus berusaha dengan belajar yang rajin juga giat. dan jangan pernah menyerah walau segala rintangan yang dihadapi memang berat. dan jangan lupa untuk selalu berikhtiar dan berdo\'a kepada Allah SWT.',	'pengalaman organisasi yang aku miliki yaitu menjadi anggota OSIS ketika SMP dan SMA, pernah juga menjadi anggota Jurnalistik sekolah saat itu, yang juga dilanjut menjadi anggota BEM di perkuliahan saat ini.',	1,	1654509927,	NULL,	0),
('SCHLR-MHRSK-f5c931',	'USR-MHRSK-c2187',	'MAHRISA KHOIROTIN NISA\'',	'2003-02-07',	'85335045508',	'Ronowijayan, Siman, Ponorogo',	'Tadris Matematika/Fakultas Tar',	'Universitas Islam Negeri Sayyi',	'3.54',	'2',	'Saya merupakan seorang Mahasiswa yang sedang aktif mencari pengalaman dan pengetahuan batu. Selain berkecimpung di dunia akademik saya juga gemar mengasah bakat dan minat saya di dunia speaking. Saya telah menjuarai beberapa lomba, seperti lomba geguritan, puisi, pidato bahasa Arab, pidato bahasa Indonesia, Telling Story, dan Taqdimul Qishoh. ',	'Saya mempunyai ambisi besar untuk terus berproses menjadi diri yang bermanfaat, saya ingin belajar sekaligus keliling dunia dengan cara mengikuti event beasiswa dari berbagai lembaga disertai persiapan matang dari berbagai aspek. Saya ingin membanggakan kedua orang tua dengan cara belajar bersungguh-sungguh serta menunjukkan prestasi-prestasi saya yang saya peroleh. ',	'Saya merupakan seorang aktivis NU sejak masa SMP. Saya mengikuti IPPNU dan segala bentuk kegiatannya yang berkaitan dengan masyarakat. Peran saya sebagai Ketua membuat saya harus banyak belajar tentang dunia organisasi dan interaksi sosial. Saya juga pernah menjadi anggota PMR di masa SMA, hal ini menjadi salah satu langkah saya untuk membantu sesama. ',	1,	1653523140,	NULL,	0),
('SCHLR-MHSBR-76cdf6',	'USR-MHSBR-4452c',	'Moh. Sabri Arrozik',	'2003-02-26',	'82252522830',	'Jl. Tamansari Manglayang Regency, Cimekar, Kec. Cileunyi, Kab. Bandung',	'Perencanaan Wilayah dan Kota',	'Institut Teknologi Bandung',	'2.72',	'2',	'Saya merupakan mahasiswa Sekolah Arsitektur, Perencanaan, dan Pengembangan Kebijakan program studi Perencanaan Wilayah dan Kota, Institut Teknologi Bandung angkatan 2021. Saya memiliki keinginan untuk merencanakan, merancang, dan menciptakan sebuah daerah yang layak huni dan bernilai estetis, serta mampu menciptakan SDM yang berkualitas. Dengan kemampuan yang saya miliki, saya ingin berkontribusi menyelesaikan masalah-masalah di perkotaan atau di perdesaan baik di masa sekarang mau pun di masa yang akan datang.',	'Mimpi terbesar saya adalah menjadi seorang pemimpin lebih spesifik lagi ingin menjadi  seorang gubernur Provinsi Sulawesi Tengah. Untuk mewujudkan mimpi saya tersebut saya menyusun beberapa strategi dan target-target dari kecil hingga besar yang harus saya capai dalam kurun waktu tertentu. Ada beberapa cara yang saya terus lakukan dan usahakan semaksimal mungkin seperti menambah wawasan dan pengalaman sebanyak mungkin guna meningkatkan kualitas diri. Kemudian, saya juga berusaha membangun relasi yang baik sebanyak mungkin. Lalu, cara saya selanjutnya yaitu dengan membangun usaha atau bisnis yang dapat memperbaiki dan menunjang finansial saya ke depannya.',	'Iya, Sejak SD saya telah bergabung dan ikut aktif dalam organisasi kepramukaan yang ada di sekolah. Kemudian ketika SMP saya lebih aktif lagi dalam mengikuti berbagai kegiatan untuk mewakili organisasi tertentu dan membawa nama baik sekolah organisasinya yaitu Pramuka dan Rohis. Di SMA, saya terus meningkatkan dan menambah pengalaman saya dalam hal organisasi atau kegiatan-kegiatan tertentu. Ketika SMA, saya diamanahkan untuk mejadi ketua Rohis di sekolah saya tepatnya di SMAN 1 Palu. Di samping menjadi ketua Rohis, saya juga ikut aktif dalam berbagai organisasi dan ekstrakulikuler yang ada di sekolah seperti Pramuka, KIR, PIK-R, PMR, Teater, Break Dance, dan Tim Olimpiade. Ada yang saya jalani hingga lulus, ada juga yang saya jalani hanya di tahun pertama saja. Ketika SMA itu juga saya pernah menjadi relawan staff media pada acara HIjrahFest Palu tahun 2019. Saat di ITB sekarang, saya ikut aktif dan terdaftar sebagai Staf Bina Satuan Pramuka ITB yang dalam waktu dekat akan mengadakan kegiatan pengabdian masyarakat di desa Ciporeat, Kab. Bandung.',	1,	1655197701,	NULL,	0),
('SCHLR-MHSBR-82ff25',	'USR-MHSBR-4452c',	'Moh. Sabri Arrozik',	'2003-02-26',	'82252522830',	'Jl. Tamansari Manglayang Regency, Cimekar, Kec. Cileunyi, Kab. Bandung',	'Perencanaan Wilayah dan Kota',	'Institut Teknologi Bandung',	'2.72',	'2',	'Saya merupakan mahasiswa Sekolah Arsitektur, Perencanaan, dan Pengembangan Kebijakan program studi Perencanaan Wilayah dan Kota, Institut Teknologi Bandung angkatan 2021. Saya memiliki keinginan untuk merencanakan, merancang, dan menciptakan sebuah daerah yang layak huni dan bernilai estetis, serta mampu menciptakan SDM yang berkualitas. Dengan kemampuan yang saya miliki, saya ingin berkontribusi menyelesaikan masalah-masalah di perkotaan atau di perdesaan baik di masa sekarang mau pun di masa yang akan datang.',	'Mimpi terbesar saya adalah menjadi seorang pemimpin lebih spesifik lagi ingin menjadi  seorang gubernur Provinsi Sulawesi Tengah. Untuk mewujudkan mimpi saya tersebut saya menyusun beberapa strategi dan target-target dari kecil hingga besar yang harus saya capai dalam kurun waktu tertentu. Ada beberapa cara yang saya terus lakukan dan usahakan semaksimal mungkin seperti menambah wawasan dan pengalaman sebanyak mungkin guna meningkatkan kualitas diri. Kemudian, saya juga berusaha membangun relasi yang baik sebanyak mungkin. Lalu, cara saya selanjutnya yaitu dengan membangun usaha atau bisnis yang dapat memperbaiki dan menunjang finansial saya ke depannya.',	'Iya, Sejak SD saya telah bergabung dan ikut aktif dalam organisasi kepramukaan yang ada di sekolah. Kemudian ketika SMP saya lebih aktif lagi dalam mengikuti berbagai kegiatan untuk mewakili organisasi tertentu dan membawa nama baik sekolah organisasinya yaitu Pramuka dan Rohis. Di SMA, saya terus meningkatkan dan menambah pengalaman saya dalam hal organisasi atau kegiatan-kegiatan tertentu. Ketika SMA, saya diamanahkan untuk mejadi ketua Rohis di sekolah saya tepatnya di SMAN 1 Palu. Di samping menjadi ketua Rohis, saya juga ikut aktif dalam berbagai organisasi dan ekstrakulikuler yang ada di sekolah seperti Pramuka, KIR, PIK-R, PMR, Teater, Break Dance, dan Tim Olimpiade. Ada yang saya jalani hingga lulus, ada juga yang saya jalani hanya di tahun pertama saja. Ketika SMA itu juga saya pernah menjadi relawan staff media pada acara HIjrahFest Palu tahun 2019. Saat di ITB sekarang, saya ikut aktif dan terdaftar sebagai Staf Bina Satuan Pramuka ITB yang dalam waktu dekat akan mengadakan kegiatan pengabdian masyarakat di desa Ciporeat, Kab. Bandung.',	1,	1655197825,	NULL,	0),
('SCHLR-MKHMM-750a72',	'USR-MKHMM-84fad',	'Mukhammad Aldy Riyan Saputra',	'2004-04-05',	'81229207186',	'Duku RT04/RW03, Repaking, Wonosamodro, Boyolali, Jawa Tengah',	'Pendidikan Bahasa Inggris',	'Universitas Tidar',	'9.6',	'1',	'Haloo\r\nNama aku Mukhammad Aldy Riyan Saputra, panggil saja Aldy. Aku baru saja lulus SMA tahun 2022 ini, sekarang telah diterima PTN prodi Pendidikan Bahasa Inggris di Universitas Tidar. Sebab aku masih Mahasiswa Baru jadi untuk bagian GPA sekarang pada formulir ini aku isi dengan rata-rata raport terakhirku. Aku sangat suka berorganisasi saat di SMA hingga saat ini, aku selalu ingin belajar hal-hal baru, ingin meningkatkan kualitas diri dengan mengembangkan minat, bakat, potensi skills yang aku miliki. Aku juga senang bersosialisasi dengan sekitar, kepekaan terhadap sekitar menjadikan diriku untuk bergerak mengubah daerah tempat tinggal saya, salah satu contohnya dibidang literasi, saya mempunyai sebuah program kegiatan dimana meningkatkan kesadaran pentingnya literasi bagi pemuda di Desa saya. Saya senang menjadi sebagian dari lilin-lilin Desa yang tersebar di seluruh Indonesia.',	'Mimpi terbesar saya adalah mampu membawa kebermanfaatan bagi diri dan sekitar. Melalui kepekaan dan kesadaran, saya mempunyai untuk menjadi manusia yang bermanfaat. Cara untuk mewujudkan mimpi saya, ialah dengan mengubah pribadi saya terlebih dahulu, kemudian mulai bergerak untuk membawa perubahan bagi lingkungan, saya juga akan mengajak orang-orang sekitar termasuk teman-teman untuk turut menjadi Agent of Change untuk kemakmuran Desa.',	'Selama SMA saya aktif diberbagai organisasi, seperti OSIS menjabat Wakil Ketua, Paskibra menjabat sebagai Sekretaris, dan Karya Ilmiah Remaja (KIR) sebagai Anggota. Kemudian untuk saat ini saya bergabung dalam organisasi komunitas yang ada di Boyolali yang berfokus pada pemberdayaan pemuda khususnya Kabupaten Boyolali, yaitu Rumah Cendekia Boyolali, di sini saya tergabung dalam Divisi Beasiswa. Dengan mengikuti berbagai organisasi saya mampu belajar bagaimana mengupgrade diri, mengembangkan skills, dapat memanajemen kegiatan serta waktu. Hal itu sangat berpengaruh bagi saya, mengubah mindset dan perilaku saya untuk terus berkembang dan membawa perubahan bagi diri dan sekitar.',	1,	1655739404,	NULL,	0),
('SCHLR-MLCHS-62234d',	'USR-MLCHS-bf10b',	'Malchia isifi antasy ',	'2003-03-14',	'85713044887',	'Ds terik tani rt 19 rw 06 kec karangmalang plumbungan ',	'Psikologi ',	'Uin sunan kalijaga ',	'3.30',	'1',	'Seorang yang ingin tarus mencari tau akan hal baru dan suka akan tantangan adalah hal yang tak lepas dari diri saya ',	'Begitupun tekad saya untuk menjadi seorang motivator agar bisa menjadi manfaat bagi masyarakat luas dan membuka wawasan untuk hal yang mungkin sulit di wujudkan menjadi kemungkinan yang pasti ',	'Menjalani program pengabdian disalah satu tempat yang bisa dibilang terpencil dan sulit akses apapun membuat saya berfikir untuk menyelesaikan masalah di suatu tim ( pengabdian gontor putri ) dan pengambilan keputasan ',	1,	1654153825,	NULL,	0),
('SCHLR-MLDHN-8b1ce7',	'USR-MLDHN-2a288',	'amelia dheany',	'2003-01-24',	'8119512401',	'jalan cililitan besar no.47',	'Teknik Industri',	'UPNVJ',	'3.75',	'2',	'Namaku Amelia Dheany dan saat ini sedang berada diumur 19 tahun. Aku berkuliah di UPNVJ dan mengambil jurusan teknik industri. Bicara tentang diriku,aku itu dikenal sebagai orang yang talkactive,dapat diandalkan,penyemangat,dan ceria. Aku ketika bertemu dengan orang baru awalnya aku hanya mengamati dulu sifat dan perilaku mereka,karena aku mau nantinya caraku bersikap dan berbicara akan membuat mereka nyaman,mungkin bisa dibilang salah satu trick aku dalam membuat relasi. Di era pandemi kaya gini,aku sering ngelakuin hobby aku yaitu nonton drama, aku nonton banyak genre , tujuannya sendiri karena aku jadi tau banyak hal berbeda di dunia ini,dari permasalahan hidup seseorang,kebahagiaan/kesedihan seseorang,dan bagaimana mereka menghadapinya. Aku ngerasa tiap sehabis nonton drama,aku pasti dapet pelajaran tertentu/bahkan kutipan dan tips buat menjalani/memotivasi kehidupan ini,makanya aku seneng banget. Tapi aku harus menyeimbangi juga antara hobbyku dengan mimpi dan tanggung jawabku,salah satunya sebagai mahasiswa. Belakangan ini untuk menambah pengalaman baru dan aktivitas bermanfaat, aku banyak mencari\" informasi tentang organisasi dan juga beasiswa. Aku dari kecil selalu berdoa supaya sekiranya aku ada di dunia ini dapat bermanfaat bagi orang lain,dan dapat membanggakan kedua orangtuaku. Hal ini juga yang membuatku tidak pernah berhenti berusaha. Aku juga orang yang suka melakukan banyak hal nekat yang mungkin menurut beberapa orang aneh/diluar dugaan. Tapi aku rasa itu menjadi kreatifitas sendiri buat diriku,dan nantinya dari sana aku akan mendapatkan ide baru. Mungkin ini yang aku bisa ceritain tentang diriku. Aku harap lewat hal ini makin banyak hal bermanfaat lain yang bisa aku lakuin.',	'Dari aku tk-sma pengen banget jadi dokter,terutama dokter kulit. Waktu SMA aku pernah ngalamin breakout parah diwajahku,yang bener\" buat aku jadi gapercaya diri buat ngelakuin apapun. Dan sebelum itupun banyak orang yang ngalamin hal sama kaya aku dan buat mereka jadi gapercaya diri juga. Tapi ternyata aku gamasuk kuliah ptn jurusan kedokteran,dan kalaupun swasta orangtua ga mampu buat bayarnya.Jadi aku mutusin bukan buat mengganti cita\" tapi menemukan cara lain buat mencapai tujuan aku itu. Kalo ditanya mimpi terbesarku apa,jawabannya yaitu membuat skincare/obat/klinik kulit gratis buat orang yang membutuhkan. Mungkin bukan sebagai dokter,tapi jalan lain dengan tujuan yang sama. Aku gamau ada lagi yang mengeluh gapercaya diri karna hal tersebut. Gimana cara aku mewujudkannya? Tentunya dengan belajar dan gapernah berhenti buat berusaha. Aku gamau kegagalan kedua dalam menggapai cita\"ku, aku mau membuktikan ke diriku sendiri bahwa aku bisa.',	'ya,dari aku sekolah sd-sma aku pasti milih buat ikut ekstrakurikuler yang kaitannya dengan menolong orang,sd aku ikut dokter cilik,smp-sma aku ikut PMR. Waktu SMP aku ikut diklat PMR,disitu kita diajarin gimana make tandu dan menolong orang. Aku ngangkut orang dengan jalan kaki pakai tandu dan lewatin beberapa rintangan. Sebenernya aku ngerasa berat dan lelah tapi karna aku seneng,aku gangerasain pada saat itu. Aku juga belajar gimana cara ngobatin luka,gimana cara membantu kaki/tangan yang patah,dll.  Di kuliahpun aku ikut event pengabdian masyarakat dengan pergi ke panti asuhan dan memberikan beberapa makanan pokok. Disitu aku excited bgt karna bisa ketemu dengan mereka secara langsung. Ekspresi yang mereka kasih ke kita juga bikin aku makin semangat buat ngebantu mereka.',	1,	1655715016,	NULL,	0),
('SCHLR-MLDYF-810388',	'USR-MLDYF-0387f',	'Maulidya Fasha Azzahra',	'2002-05-16',	'859152973259',	'Kp. Balekambang RT. 005 RW. 018 Desa Sukamaju Kecamatan Majalaya Kabupaten Bandung Jawa Barat',	'teknik Sipil',	'Universitas Sangga Buana YPKP',	'3.56',	'2',	'Saya selalu menekuni apapun hal yang saya minati, tidak takut menjadi diri sendiri, saya orang yg mudah bergaul saya senang jika dipercaya seseorang untuk mendengarkan ceritanya atau bahkan berpendapat tentang mereka, saya bisa dekat dekat siapapun tetapi bisa di bilang saya tidak mempunyai banyak teman, ketika saya memiliki masalah saya merasa lebih tenang jika sudah menulisnya di note hp jika memang di hari esok saya sudah baik baik saja saya selalu menghapusnya, saya selalu mengingat sekecil apapun apresiasi atau pengakuan dari oranglain karena itu membuat saya lebih bersemangat dalam melakukan suatu hal.',	'Mimpi terbesar saya yaitu menjadi wanita karir dan mandiri, cara saya mewujudkannya dengan memahami kelebihan juga kekurangan dalam diri saya, tetap fokus pada tujuan dan perubahan, manfaatkan setiap kesempatan yang ada, percaya bahwa setiap usaha yang hebat bisa meraih hal yang hebat agar tidak pernah menyerah apapun hambatannya. ',	'Saya merupakan salah satu anggota himpunan teknik sipil di kampus, saya aktif mengikuti kegiatan yang dilaksanakan oleh himpunan, sering dipercaya menjadi ketua, pembawa acara dsbnya',	1,	1653738086,	NULL,	0),
('SCHLR-MLJWT-f529e5',	'USR-MLJWT-a88f8',	'Amalia Juwita Kusuma',	'2004-09-19',	'85770668171',	'Desa Sumberarum, Kecamatan Kerek, Kabupatrn Tuban',	'Pendidikan Sejarah',	'Universitas Negeri Surabaya',	'9.36',	'1',	'Nama saya Amalia Juwita Kusuma. Lahir di kota Tuban, 19 September 2004. Hobi saya adalah membaca buku dan bersepeda. Saat ini saya baru saja menyelesaikan studi di SMA Negeri 4 Tuban di jurusan IPS (Ilmu Pengetahuan Sosial). Dan saya telah diterima di UNESA prodi pendidikan sejarah lewat jalur SNMPTN. \r\nSaya adalah anak pertama dari dua bersaudara. Adik saya sebentar lagi naik kelas 3 SMK. Saya lahir di keluarga yang sederhana. Ayah saya bekerja sebagai satpam di pelabuhan sedangkan ibu saya bekerja sebagai penjahit.\r\nRiwayat pendidikan saya adalah, saya masuk TK Arum Puspitasari pada tahun 2008 dan dilanjutkan di MI Salafiyah Margomulyo pada tahun 2010 hingga tahun 2016. Setelah lulus Madrasah, saya melanjutkan pendidikan di SMPN 4 Tuban pada tahun 2016-2019. Kemudian saya melanjutkan bersekolah di SMAN 4 Tuban sejak tahun 2019 hingga 2022 dan pernah menjabat sebagai  wakil ketua ekstrakulikuler teater.\r\nPada masa SMA, saya berhasil mendapatkan medali emas di olimpiade sejarah tingkat nasional, medali perak di olimpiade sejarah tingkat nasional, dan medali perak di olimpiade geografi tingkat nasional yang saya ikuti.\r\nTahun ini adalah tahun pertama saya sebagai mahasiswa jurusan Pendidikan Sejarah. Alasan saya memilih jurusan pendidikan selain karena materi perkuliahan yang sesuai dengan minat saya, juga karena keprihatinan saya dengan bidang sejarah yang banyak dianggap membosankan dan tidak penting. Saya ingin mengubah midset tersebut dengan cara belajar yang baru dan menyenangkan.\r\nAdanya beasiswa dari YBB Foundaation tentu akan membantu dalam meringankan beban biaya pendidikan dan menambah motivasi saya agar dapat berkontribusi pada program yang dijalankan oleh pihak penyelenggara beasiswa tersebut.\r\n',	'Mimpi saya sedari kecil adalah menjadi seorang guru. Karena saya suka berbagi ilmu dengan orang lain. Namun seringkali dedikasi seorang guru itu dipandang sebelah mata, mulai dari upah dan pekerjaan yang dianggap sangat mudah. Menjadi seorang guru bukan hanya tentang materi namun seberapa banyak manfaat yang telah diberikan. Banyak sekali peserta didik yang kurang memahami penjelasan materi yang diberikan di sekolah sehingga bisa menghambat mereka dalam proses belajar kedepannya. Apalagi di era pandemi dimana pembelajaran daring saat ini dirasa belum cukup membantu kesulitan yang dihadapi oleh siswa. Karena itulah dengan cita-cita saya untuk menjadi seorang guru, saya ingin berkontribusi di bidang pendidikan dengan membuka lembaga bimbingan belajar di sekitar daerah saya dan di daerah yang bimbingan belajarnya masih kurang, dengan biaya yang terjangkau dan tentunya tidak memberatkan. Harapan saya adalah dapat memberikan peserta didik tambahan ilmu di luar materi pendidikan formal dan dapat meningkatkan pemahaman peserta didik terhadap mata pelajaran yang dianggap sulit. Memaksimalkan kualitas SDM lewat lembaga bimbingan belajar memang terdengar susah, namun tidak mustahil untuk diwujudkan. Saya percaya bahwa bersama YBB Foundation, saya dapat mewujudkan cita-cita saya dan bisa menyelesaikan studi di bangku perguruan tinggi dengan baik, serta dapat meningkatkan kualitas dan memaksimalkan potensi dalam diri saya.',	'Saat masuk SMA saya mengikuti ekstrakulikuler teater untuk menjambah pengalaman. Saat pemilihan struktur oganisasi ekstrakulikuler teater, saya terpilih menjadi wakil ketua periode 2019-2020. Tugas saya adalah mmbantu ketua melaksanakan kegiatan ekskul teater dan bertanggung jawab kepada pembina dan ketua teater. Salah satu pengalaman saya dalam mengikuti kegiatan teater adalah saat itu akan diadakan pentas di sekolah untuk menyambut tamu dari kepala sekolah. Kami anggota ekskul teater ditugaskan untuk memberikan hiburan pertunjukan teater. Pembina pun memilih naskah  yang bercerita tentang gadis yang berusaha menggapai mimpi namun dicemooh dan dihina orang-orang sekitar dan dia dianggap tidak mampu untuk menggapai mimpinya. Setelah itu pembina melakukan pemilihan tokoh terhadap anggota teater. Saya pribadi memerankan tokoh antagonis yang menghina si protagonis. Dalam prosesnya, kami latihan berulang kali. Meskipun waktunya sedikit, tapi kami tetap berusaha untuk bisa menampilkan yang terbaik. Akhirnya saat pentas tiba. Saya lumayan gugup, tapi teman-teman men-support saya agar tetap semangat. Pentas pin dimulai. Semua pemain menghayati perannya masing-masing. tak terasa waktu pentas berlalu begitu cepat. pentas pun usai dan diakhiri dengan riuh tepuk tangan penonton. Saya dan teman-teman sangat bahagia karena kerja keras latihan berkali-kali telah terbayar dan menjadi  pengalaman tak terlupakan bagi saya.',	1,	1656635313,	NULL,	0),
('SCHLR-MLND-e86f44',	'USR-MLND-a2dc36',	'Melinda -',	'2003-07-08',	'81521589610',	'Jln. Sukorejo Rt. 22 Makroman',	'Ilmu Hukum',	'Universitas Mulawarman',	'4.',	'2',	'Assalamu’alaikum warahmatullahi wabarakatuh\r\n\r\nKepada yang terhormat, bapak/Ibu \r\nPenyelenggara Beasiswa Pemuda By\r\n\r\nHidup yang tidak pernah dipertaruhkan, adalah hidup yang tak pernah dimenangkan – Sutan Sjahrir. Kata-kata itu menjadi percikan bara bagi saya untuk bisa mencoba berbagai hal menarik dalam hidup, dan berani mempertaruhkan apa yang saya bisa. Saya adalah mahasiswi dari sebuah universitas di Kalimantan timur, yaitu Universitas Mulawarman. Saat ini saya sedang menempuh pendidikan S1 di jurusan hukum. Namun selain memiliki passion di bidang hukum, saya juga passionate di bidang public speaking. Dibalik itu, sebenarnya passion public speaking saya-lah yang mampu membawa diri saya pada jurusan ini dan menjadi diri saya yang sekarang.\r\n\r\nSaya memulai melatih diri saya untuk aktif dalam dunia public speaking pada kelas 1 SMP, dengan diikutkan pada kompetisi pidato serta puisi, kemudian saya melanjutkan untuk mendalami skill ini pada saat SMA di bidang debat SMA tingkat kota, provinsi, bahkan nasional. Kepercayaan diri, kemauan untuk terus ingin tahu banyak hal, dan terus meningkatkan pengetahuan pada diri saya muncul perlahan. Saya melatih diri di setiap kompetisi yang saya ikuti, dan hingga saat ini saya masih aktif menjadi perwakilan universitas dalam ajang kompetisi debat tingkat kota hingga nasional.\r\n\r\nTidak berhenti sampai dengan disitu, saya percaya bahwa nantinya diperlukan juga kemampuan untuk berorganisasi dan kerjasama tim yang baik dalam lingkungan kerja nantinya. Sehingga saya melatih skill kerjasama tim di dalam organisasi. Saya sudah mengikuti organisasi sejak usia 15 tahun, dan hal itu membuat saya mengerti mengenai manajemen organisasi dan kerjasama dalam tim. Hingga saat ini, total sudah ada delapan organisasi yang saya aktif di dalamnya dan memegang posisi sebagai ketua, sekretaris, maupun bendahara.\r\n\r\nSaya merupakan orang yang sangat passionate dengan pengembangan diri, saya merupakan pembaca self improvement yang aktif dan saya ingin membagikan hal-hal tentang pengembangan diri. \r\n\r\nBerangkat dari hal itu, saya saat ini bersama rekan saya membangun sebuah komunitas yang bergerak pada bidang pendidikan untuk bisa berkontribusi pada pendidikan indonesia dan peningkatan karakter. \r\n\r\nMemutuskan untuk mendaftar Beasiswa by ini adalah pilihan saya untuk membuat langkah yang berbeda, untuk bisa menemukan orang-orang yang dapat sama-sama saling mendukung untuk mencapai mimpi yang dapat lebih menyejahterakan masyarakat kita, seminimal mungkin dapat memberikan kontribusi terbaik dengan berbagi ilmu, sehingga saya berharap tulisan ini nantinya dapat dijadikan pertimbangan Bapak/Ibu penyelenggara beasiswa By untuk memberikan saya kesempatan menjadi salah satu kandidat yang layak menerima beasiswa ini.\r\n\r\nTerima kasih\r\nSalam hangat,\r\nMelinda\r\n',	'Assalamu’alaikum warahmatullahi wabarakatuh\r\n\r\nKepada yang terhormat, bapak/Ibu \r\nPenyelenggara Beasiswa Pemuda By\r\n\r\nBermimpilah setinggi langit, jika engkau jatuh kau akan jatuh diantara bintang-bintang – Ir. Soekarno. Mimpi adalah tentang hal yang saat ini mustahil, walaupun seperti itu saya tetap memilih untuk memiliki mimpi. Hal ini berangkat dari diri saya sebagai seorang remaja yang gemar mengikuti kompetisi debat, mendapatkan achievement dan lain sebagainya. Dalam beberapa waktu, saya memang merasa senang karena telah mendapatkan apresiasi, namun di lain sisi ada kehampaan di diri saya. Saya merasa selama saya mendapatkan hal ini dan itu, mengapa orang-orang di sekitar saya tidak berubah. Mengapa dengan saya mendapatkan banyak hal, lingkungan saya tidak bertambah baik dengan adanya saya. Hal tersebut menjadi sebuah kegelisahan yang amat dalam dalam diri saya.\r\n\r\nAkhirnya muncullah sebuah gagasan untuk bisa berkontribusi dalam perkembangan lingkungan saya, khususnya di lingkungan kemahasiswaan. Saya memiliki mimpi untuk menjadi seorang CEO dari sebuah perusahaan yang bergerak di bidang pengembangan diri anak muda serta juga bergerak di bidang pengembangan softskill dan hardskill namun lebih inovatif dan anak muda-able. Saat ini, langkah pertama sudah saya tempuh, yaitu membangun tim yang dapat melaksanakan visi tersebut.\r\n\r\nBagi saya, hal tersebut bukan tidak mungkin kelak akan saya capai bersama orang-orang yang mau berjuang dengan saya. Saya yakin dan percaya bahwa anak muda mempunyai matanya sendiri untuk bisa melihat dunia dari sudut yang berbeda, adalah mereka yang menginginkan dunia lebih sederhana namun tetap memiliki makna. Nantinya, mimpi ini sedikit demi sedikit akan saya wujudkan, dan kelak ini tidak hanya menjadi sebuah mimpi terbesar yang saya miliki, namun juga kontribusi terbesar yang bisa saya berikan.\r\n\r\nDemikian singkat cerita mimpi terbesar yang saya miliki, semoga dengan ini saya dapat dipertimbangkan sebagai salah satu kandidat yang mendapatkan kesempatan menjadi awardee di beasiswa ini.\r\n\r\nTerima kasih\r\nSalam hangat,\r\nMelinda',	'Assalamu’alaikum warahmatullahi wabarakatuh\r\n\r\nKepada yang terhormat, bapak/Ibu \r\nPenyelenggara Beasiswa Pemuda By\r\n\r\nSeorang pemenang selalu berpikir tentang kerjasama, sedangkan seorang pecundang selalu berpikir bagaimana menjadi yang berkuasa – Unknown. Hal itulah yang menjadi penyemangat saya untuk bisa menjadi seseorang yang bisa diajak bekerjasama dalam tim. Saya mulai mengabdikan diri pada organisasi pada saat usia 15 tahun hingga saat ini. Berikut adalah organisasi yang pernah saya ikuti:\r\n\r\n1.	Pramuka\r\nSaya berada pada bidang ini sejak kelas 1 SMA hingga lulus. Di Pramuka saya mempelajari banyak hal terkait pentingnya kerjasama tim, pentingnya menjadi orang yang spontan dan gerak cepat serta menjadi anak muda yang mudah berinovasi.\r\n\r\n2.	Kerohanian Islam\r\nDi Rohis saya mempelajari tentang bagaimana membentuk lingkaran pertemanan yang membawa kita ke jalan yang baik dan membantu saya untuk dapat menghindari lingkaran pertemanan yang cenderung melakukan hal yang tak bermanfaat. \r\n\r\n3.	Komunitas Debat\r\nDi dalam komunitas inilah diri saya sebagai seorang debater dimulai. Disini saya belajar untuk dapat berpikir kritis, menjadi anak muda yang tanggap terhadap berbagai macam isu sosial, pendidikan, bahkan teknologi. Dari sini saya memupuk kepercayaan diri serta kemampuan untuk berbicara di depan umum. \r\n\r\n4.	Dewan Kerja Ranting Pramuka Sambutan\r\nDi Dewan kerja ini, saya mendapatkan ilmu tentang keorganisasian yang lebih mendalam, terkait dengan tupoksi kerja tim, penyelenggaraan kegiatan, hingga pada membangun relasi antara pramuka penegak (Pramuka muda) dengan pramuka dewasa. Hal ini memanglah tidak mudah, karena diperlukan ketrampilan untuk bisa menyelaraskan cara berkomunikasi antar generasi, namun hal ini berhasil saya lakukan dan saat ini saya menjadi orang yang terbuka untuk dapat berkomunikasi lintas generasi.\r\n\r\n5.	Komunitas Improve\r\nDi komunitas improve ini, merupakan tempat berkumpulnya para mahasiswa yang memiliki prestasi tingkat provinsi hingga nasional di berbagai bidang, misalnya debat, pidato, karya tulis ilmiah, konten kreator, hingga duta genre. Fokus dari komunitas ini adalah untuk berbagi ilmu antara mahasiswa dengan siswa sma sederajat, dari hal ini saya banyak mempelajari pentingnya menggunakan ilmu yang kita punya untuk berkontribusi kepada orang-orang di sekitar kita.\r\n\r\n6.	House Ilmu Indonesia\r\nHouse ilmu indonesia merupakan komunitas yang bergerak di bidang pengembangan diri anak muda. Di komunitas ini saya diberikan banyak kesempatan untuk menjadi pembicara di depan umum seperti mc maupun moderator dalam acara-acara nasional yang diselenggarakan. Di sini saya banyak belajar mengenai tanggung jawab dan kedisiplinan, hal tersebut saya dapatkan dari founder house ilmu sendiri yang saya rasa memiliki jiwa kepemimpinan yang baik dan inspiratif bagi saya. \r\n\r\n7.	Court Monitoring Unmul dan KPK\r\nOrganisasi ini adalah salah satu organisasi yang ada di Universitas Mulawarman. Tugas yang ada pada organisasi ini adalah menjadi pengamat di persidangan kasus tindak pidana korupsi. Saya mengikuti organisasi ini dengan murni untuk memulai mencari pengalaman dan pengetahuan lebih awal mengenai dunia hukum di dalam persidangan.\r\n\r\n8.	Mulawarman Legal Competition Community\r\nKomunitas ini merupakan komunitas yang menjadi wadah atau yang mengarahkan para mahasiswa di Fakultas Hukum Universitas Mulawarman untuk mengikuti berbagai kompetisi tingkat kota hingga nasional, entah itu perlombaan debat, kti, ataupun perlombaan sidang. Di dalam komunitas ini saya mendapatkan lingkaran pertemanan yang saling mendukung satu sama lain untuk dapat sama-sama menjadi mahasiswa berprestasi. \r\n\r\nDemikian cerita singkat tentang organisasi maupun komunitas yang saya ikuti. Mungkin kelihatannya itu cukup banyak bagi seorang mahasiswa, namun bagi saya mengikuti organisasi maupun komunitas adalah keharusan, karena dari situlah saya bisa belajar untuk mengerti kehidupan sekaligus memahaminya.\r\n\r\nSemoga apa yang saya sampaikan dapat dipertimbangkan sebagai salah satu calon yang layak mendapatkan beasiswa ini.\r\n\r\nTerima kasih\r\n\r\nSalam hangat,\r\nMelinda\r\n',	1,	1654515739,	NULL,	0),
('SCHLR-MLPRM-c54e90',	'USR-MLPRM-3d917',	'mila permatasari',	'2006-03-17',	'881027230462',	'rt 4, rw 7, dsn. balong, ds. gerih, kec. gerih, kab. ngawi, jawa timur',	'saintek',	'mas ma\'arif karangrejo magetan',	'8.45',	'1',	'aku adalah anak petani desa aku tu pengen banget dapet beasiswa ini soalnya kalau dapet mau aku gunain buat bayar sekolahku aku masih punya tunggakan di sekolah banyak sekitar 1.200.000an, terus kalau sisa aku mau gunain buat claim hadiah di olimpiade, alhandulillah aku sering menang olimp tadi baru pernah claim 1× itupun cuma e-sertif sama e-piagam soalnya uang aku emng cukupnya cuma segitu, kalau dapet beasiswa inii aku mau gunain buat ikut olimp lagii biar aku dapet piagam aslii',	'aku punya mimpi kuliah di luar negri, untuk negaranya yaitu jerman, philipina, italia, jepang, australia. antara banyak negara itu aku pengen salah satu diantaranya. aku pengen jurusan matematika aku pengen kaya jerome polin pengen kaya beliau yang bisa sukses mapel favv aku juga matematika jadii aku bakal terus usaha biar bisa kaya beliau ',	'iya, aku pernah ikut organisasi dp (dewan penggalang) tapi itu pas kelas 9 smp dulu, kalau buat saat ini aku mau mencalonkan osis soalnya udah mau kenaikan kelas 11. ikut dp tu seruuu melatih kekompakan kalau ada yang sakit langsung di bantu pokoknya seruu + suka gotong royong',	1,	1653629591,	NULL,	0),
('SCHLR-MLPTR-c445f4',	'USR-MLPTR-0d7ce',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655541781,	NULL,	0),
('SCHLR-MMCHR-e984b0',	'USR-MMCHR-f7ca4',	'Imam Choerurizki',	'2004-03-04',	'82321443188',	'Bumi Panyileukan Blok E6/13 RT 002/004 Kelurahan Cipadung Kidul Kec. Panyileukan Kota Bandung',	'IPA',	'SMAN 24 Bandung',	'0',	'6',	'Saya Imam, seorang pemuda biasa saja yang memiliki moto selalu ingin bermanfaat bagi orang lain. Saya bercita-cita untuk menuntut ilmu di PTN yang saya inginkan, yaitu ITB dengan jurusan di bidang IT (STEI-K). Saya berminat mendalami bidang ini karena melihat potensi berkembangnya teknologi di masa yang akan datang.',	'Mimpi terbesar saya adalah bisa bermanfaat bagi orang lain dalam skala yang besar. Salah satu cara untuk mencapai mimpi tersebut adalah dengan saya mendalami bidang Informasi dan Teknologi. \r\nSeperti yang dapat diamati pula, manusia perlahan sudah mulai mengimplementasikan teknologi tinggi ke berbagai sendi kehidupan dan mengubah kebiasaan lamanya. Contohnya seperti, interaksi antar manusia, dulu manusia harus bertemu secara tatap muka untuk melakukan interaksi antara satu sama lain, sedangkan sekarang dengan adanya gadget dan koneksi internet, manusia yang terpisah jarak yang jauh pun dapat berinteraksi tanpa harus menghabiskan waktu untuk bertemu. Sebuah konsep yang revolusioner, yang mungkin tak pernah terbayangkan oleh manusia di zaman dahulu, tentunya hal ini menguntungkan manusia. \r\nNamun, di sisi lain banyak juga ancaman dan tantangan yang harus dihadapi oleh manusia dengan hadirnya teknologi tinggi ini. Di antaranya, privacy violation, risiko tersebarnya hoax menjadi lebih cepat, dan marak munculnya berbagai masalah modern yang sebelumnya jarang terjadi seperti mental issue, anxiety, dll.\r\nBerangkat dari dualisme teknologi tersebut, sejalan dengan moto dan kemampuan yang saya punya, saya ingin ikut andil dalam perkembangan teknologi dan kompetisi global yang sedang dan terus terjadi.',	'Saya pernah tergabung dalam OSIS SMA. Dan saya menjabat sebagai salah satu koordinator bidang (Bidang 5). Tugas saya semasa menjabat adalah mengatur dan menjalankan program-program kerja yang kebanyakan berlaku di ranah internal (Kaderisasi). \r\nSelama di OSIS, saya mendapat banyak hal, di antaranya soft skill dan relasi. Kalau dulu saya tidak dimarahi kakak kelas untuk berbicara dengan bahasa baku, mungkin saya tak akan bisa mengetik bahasa baku dengan lancar seperti ini.\r\nSelain itu, saya juga sering mengajukan diri sebagai panitia di berbagai acara SMA, salah satunya, acara kelulusan. ',	1,	1654441370,	NULL,	0),
('SCHLR-MMRKS-e3a169',	'USR-MMRKS-94906',	'Muamar Kusumah',	'2001-03-25',	'895411822723',	'GG. H. Zakaria IV RT.07 RW.01 kelurahan Sukahaji, Kecamatan Babakan Ciparay - Kota Bandung',	'Manajemen Pendidikan Islam',	'Universitas Islam Negeri Sunan',	'3.81',	'4',	'Saya merupakan seorang mahasiswa UIN sunan Gunung Djati Bandung semester 4, saya anak ke 3 dari 3 bersaudara. Saya telah menempuh sekolah dasar di SDN Gentra Masekdas lulus tahun 2013 dilanjut di SMPN 24 Bandung lulus tahun 2016 dan dilanjutkan di MAN 1 Kota Bandung lulus tahun 2019. Serta sekarang dilanjutkan di UIN Sunan Gunung Djati Bandung Jurusan Manajemen Pendidikan Islam Fakultas Tarbiyah dan Keguruan masuk pada tahun 2020 sampai sekarang.\r\n\r\nKelebihan saya di antaranya yaitu mampu belajar dengan cepat dan senang belajar hal hal yang baru, bisa berkomunikasi dengan baik, memiliki semangat yang tinggi dalam segala hal, dapat memimpin, dapat publik speaking dan dapat mengoperasikan komputer. \r\n\r\nSaya memiliki kekurangan yaitu terlalu perfeksionis yang selalu ingin maksimal dalam segala hal yang sedang dilakukan sehingga menghasilkan sesuatu yang maksimal. Namun itu menjadi sebuah kekurangan saya karena perfeksionis ini terkadang menghambat waktu pekerjaan saya.\r\n\r\nSaya memiliki pegangan motto hidup saya yaitu ; \r\n- Siap memimpin dan siap di pimpin \r\n- Hayati Hadapi Nikmati\r\n\r\nSehingga dengan motto tersebut saya rasa layak untuk dapat mendapatkan beasiswa ini.',	'Mimpi terbesar saya adalah dapat kuliah sampai S3 dan mencapai gelar Doktor serta memiliki pekerjaan yang layak dan sesuai dengan kualifikasi pendidikan saya.\r\n\r\nCara saya mewujudkan nya yaitu dengan belajar sungguh - sungguh, mencari beasiswa dan meningkatkan softskill yang dimiliki sehingga dapat terlaksana dan terwujud mimpi mimpi tersebut',	'Iya, saya mempunyai pengalaman organisasi, \r\nAwal mula saya berorganisasi yaitu semenjak SMP di Organisasi Pramuka saat itu saya di amanahkan sebagai ketua di Pramuka, lalu saat itu saya bergabung di OSIS SMPN 24 Bandung dimulai dari staff bidang keagamaan lalu di tahun selanjutnya saya menjadi wakil ketua OSIS. \r\nSaat itu juga saya aktif kegiatan persami, Diklat kepramukaan dan lain sebagainya. Dan pada masa SMP saya sudah bergabung di organisasi kepemudaan di lingkungan masyarakat saya. \r\n\r\nKemudian pengalaman organisasi saya dilanjut di MAN 1 Kota Bandung yang menggeluti organisasi Pramuka, di sana saya sebagai Pemangku Adat juga saya aktif di Pramuka tingkat kecamatan di Dewan Kerja Ranting sebagai wakil ketua DKR. \r\n\r\nLalu di perkuliahan saya mengikuti organisasi Lembaga Dakwah Mahasiswa sebagai anggota madya dan pernah menjadi pengurus bidang Pengembangan Sumber Daya Insani tahun 2020-2021, dan sekarang menjadi staff sekretaris umum di bidang inventaris pada tahun 2022 - sekarang.\r\nSaya juga ikut Lembaga Inkubasi Kewirausahaan Mahasiswa sebagai anggota, lalu ikut Himpunan Mahasiswa Jurusan sebagai staff bidang Kerja sama Penelitian dan Pengabdian Masyarakat. \r\n\r\nSaya juga mengikuti kegiatan relawan melalui organisasi Badan Semi Otonom Rumah Kreasi dan Pembinaan Masyarakat yang dimana pernah mengikuti orientasi relawan tingkat dasar, serta beberapa kegiatan relawan lainnya. ',	1,	1653758311,	NULL,	0),
('SCHLR-MNHNK-b0f735',	'USR-MNHNK-8a7be',	'Meina Heni Kristanti',	'2000-05-08',	'82244558206',	'Purwodadi, kec. Gambiran, kab. Banyuwangi',	'PGSD / FKIP',	'Universitas Jember',	'3.49',	'6',	'Saya merupakan seorang mahasiswa pada fakultas pendidikan yang hidup dalam keluarga yang sederhana. saya memiliki tujuan dan prinsip dalam hidup saya yaitu selalu mengupgrade potensi diri.',	'Saya ingin menjadi bermanfaat bagi orang lain melalui profesi yang sesuai dengan jurusan yang saya jalani saat ini dengan cara selalu belajar dan terus mengembangkan potensi diri saya akan menjadi lebih baik.',	'Pernah, pengalaman organisasi yang pernah saya ikuti adalah ada semester ini yang mana ada organisasi ini saya menjadi sebagai staff media komunikasi. Di dalam organisasi ini yang saya dapat pelajari adalah suatu nilai kerjasama, pengembangan skill terutama dalam bidang desain, kreativitas serta ketelitian dalam mengerjakan sesuatu.',	1,	1654012852,	NULL,	0),
('SCHLR-MNKHT-0ec002',	'USR-MNKHT-89b0b',	'Munikhatus Sa\'adah',	'2000-06-16',	'895605979066',	'Sirapan Kemangsen Balongbendo Sidoarjo ',	'Psikologi ',	'Universitas Airlangga ',	'3.16',	'6',	'Saya merupakan mahasiswa semester 6 yang mampu beradaptasi dan siap dalam menghadapi dunia pekerjaan. Dalam menghadapi berbagai hal baik dalam pekerjaan maupun dalam dunia akademis saya ingin menggali dan memfasilitasi kompetensi ',	'Dalam dunia pendidikan atau akademis saya ingin melanjutkan studi dengan jenjang lebih tinggi dan mendapatkan beasiswa. Adapun cara mewujudkan yang sudah saya lakukan adalah mencari informasi tentang beasiswa dan mengikuti serangkaian seleksi, selain itu saya juga mencari support sistem yang dapat saya membantu dalam meningkatkan motivasi.',	'Organisasi mahasiswa pecinta alam merupakan salah satu komunitas yang disediakan untuk memfasilitasi kegiatan outdoor, tidak hanya berkegiatan namun dalam komunitas juga memberikan ilmu yang dapat digunakan atau diaplikasikan dalam kegiatan lapangan. Setelah melalui beberapa tahap seleksi, saya memiliki kesempatan untuk mendapatkan nomor anggota dan menjadi pengurus selama 2 periode terhitung dari tahun 2021',	1,	1654434785,	NULL,	0),
('SCHLR-MNTMS-1d6daf',	'USR-MNTMS-011c6',	'Monita Mustamu',	'2002-05-09',	'81213589803',	'Jl. Purimas 1 no 1 Rt 016 Rw 008 kelapa dua wetan ciracas jakarta timur',	'Pendidikan Bahasa Inggris',	'Universitas Indraprasta  PGRI',	'3.75',	'2',	'Nama saya Monita Mustamu, Asal saya dari Maluku tapi sejak kelas 5 SD sudah pindah ke Jakarta untuk bersekolah, saat ini saya tinggal di Panti Asuhan, Dari Kecil walaupun tubuh saya lebih munggil mungkin dari teman teman sebaya saya, tapi saya sudah memiliki mimpi mimpi besar, hingga sekarang pun saya masih memiliki mimpi mimpi tersebut. ',	'Saya memiliki Segudang mimpi dan harapan, namun yang terutama dari segalanya ialah Kelak saya berharap dan yakin saya akan menyandang gelar saya, dan jika saya mendapatkan kesempatan saya ingin melanjutkan ke jenjang S2, jika tidak, pastilah dengan berbekal ilmu dari bangku kuliah, saya sangat ingin membagi ilmu saya, membekali mereka dengan bahasa Inggris yg saya kuasai, apa yg saya lihat saat ini SDM Indonesia dari sekolah dasar bahkan ke Perguruan tinggi masih minim kemampuan bahasa Inggris nya. ',	'Belum, namun saya berharap dengan Mengikuti Program Program YBB saya dapat berkesempatan mengikuti organisasi maupun kegiatan sosial. ',	1,	1654582733,	NULL,	0),
('SCHLR-MNZLT-dff5e5',	'USR-MNZLT-49b26',	'Manzilatul Fathy ',	'2003-02-05',	'8987439252',	'Jl. Raya Malangbong rt 2 rw 3 Kecamatan Malangbong Desa cisitu \\ Kp. Bojong Kabupaten Garut',	'Keguruan dan ilmu pendidikan, ',	'Universitas Pendidikan Indones',	'3.90',	'2',	'Halo aku Manzil Saya merupakan orang yang tergolong Introvert, sangat sulit untuk mudah bersosialisasi mungkin pandangan orang, saya seperti seseorang yang sering menolak untuk bersosialisasi tetapi faktanya saya harus merasa nyaman terlebih dahulu dengan lawan bicaranya dan setelah saya masuk ke Universitas Pendidikan Indonesia dengan mengambil jurusan PGPAUD disana saya mendapatkan jawaban dan disana terdapat berbagai psikologi yang membuat saya tahu akan penyebab mengapa saya bisa menjadi seseorang yang introvert, mungkin diluar sana banyak yang masih memandang bahwa jurusan ini tidak cocok bagi saya tetapi setelah saya berusaha untuk bisa masuk jurusan ini dan Alhamdulillah diterima, disana saya banyak mendapatkan pengetahuan-pengetahuan baru seperi bisa mengenal psikologi anak, cara mengatasi anak dan  salah satunya bisa membuat introvert saya mampu menjadi 50% karena setelah saya masuk UPI saya banyak ditugaskan untuk observasi ke berbagai TK untuk itu kemampuan sosialisasi saya terasah dan masih banyak lagi yang sangat berguna bagi diri saya sendiri  \r\nTugas-tugas yang diberi oleh dosen juga bukan hanya harus membuat lagu, tetapi di jurusan PGPAUD ini harus mampu berkomunikasi dengan baik, inovatif, kreatif, dan juga harus menguasai IPTEKS, serta banyak memberikan tugas artikel/jurnal dan alhamdulillah saya sudah menulis 5 Artikel dan yang artikel lainnya dengan teman sekelas. Adapun karya saya membuat e-Book yang sudah di HKI kan yang dimana didalamnya memuat kumpulan e-Book Upaya Pembentukan Karakter Generasi Muda karena karya tahun kemarin sudah ter HKI kan tahun sekarang pun sedang menulis lagi buku mengenai permainan untuk anak usia dini. Saya juga memiliki hobby dimana hobby saya itu menggambar, membaca, menulis dan berenang. Jika ada waktu senggang saya selalu membaca atau menggambar, menggambar disini terdapat tujuan didalamnya karena selesai saya menggambar, selalu saya tempelkan kata-kata islami untuk menjadi bahan dakwah di sosial media karena isinya mengandung unsur-unsur islami yang inshaallah memuat ilmu yang bermanfaat dan bisa memotivasi banyak orang.  \r\nSaya Manzil yang sedang menginjak semester II di Universitas Pendidikan Indonesia Kampus Tasikmalaya – jurusan Pendidikan Guru Pendidikan Anak Usia Dini. Saya dilahirkan di kabupaten Garut pada tanggal 05 Februari 2003, saya merupakan anak ke 4 dari 4 bersaudara kedua kakak saya sudah menikah dan kakak yang satu lagi sedang berkuliah. Pekerjaan ayah saya yaitu Guru PNS namun tidak sertifikasi dikarenakan pendidikan terakhirnya D3, maka dari itu tidak bisa mengajukan sertifikasi dan ibu saya hanya bekerja sebagai Ibu Rumah Tangga, biaya kuliah di UPI menggunakan sistem UKT dan saya mendapatkan golongan tinggi yaitu golongan 5 yang senilai 4.100.000 padahal ayah saya merupakan PNS yang tidak mendapatkan sertifikasi, apalagi pengeluaran ayah bukan hanya untuk saya saja karena ada kakak saya yang sama sedang berkuliah dan sudah melakukan tatap muka dimana sudah banyak pengeluaran nya bukan hanya untuk UKT nya saja tetapi untuk pengeluaran lainnya, sama halnya dengan saya karena saya juga sudah melakukan tatap muka sejak awal semester 2 dan pengeluaran nya pun banyak untuk itu saya berusaha sedikit-sedikit berdagang untuk meringankan beban kedua orang tua juga dengan selalu mempromosikan barang-barang kecantikan dan juga berdagang kecil-kecilan yang disukai teman kampus meskipun tidak seberapa namun hal yang terpenting sudah berusaha untuk bisa mendapatkan sedikit penghasilan untuk menambahkan kebutuhan di kost. \r\nSebenarnya saya sudah beberapa kali ingin mendaftar beasiswa tetapi selalu ada pikiran takut untuk tidak diterima jadi selalu tidak berani untuk maju, karena ditakutkan anak PNS itu tidak dapat menerima beasiswa apalagi ditakutkan mereka tidak mengetahui bahwa ayah saya sudah serifikasi ataupun belum, saya selalu meminta do’a kepada kedua orangtua saya agar diperlancar dan bisa diterima, karena bantuan do’a mereka itu sangat penting, saya disini  mencoba untuk mengikuti pengajuan beasiswa ini.',	'Mimpi terbesarku yaitu menjadi dosen, tetapi menjadi guru juga menjadi impianku, namun saya ingin menjadi orang yang ilmu nya sangat luas dan mampu menyelesaikan semua berbagai konflik itu dapat terselesaikan dengan cara saya, cara saya dalam mewujudkannya mencari program yang membuka luasan berbagai ilmu seperti adanya atau mengadakan berbagai sosial yang dimana sosial ini memuat ilmu-ilmu yang bermanfaat dan mampu memotivasi dalam mewujudkan impian saya.',	'Pernah tetapi saat Sekolah Menengah Atas saja, menjadi relawan itu baik dan senang karena bisa membantu orang lain ketika sedang tidak baik-baik saja. Mungkin pengalaman yang diceritakan akan sedikit karena adanya covid yang menjadikan organisasi itu mati 2 tahun',	1,	1654386510,	NULL,	0),
('SCHLR-MRCHR-48bf9a',	'USR-MRCHR-b2dad',	'Maria Christy Widhayanti',	'2002-05-28',	'8113780026',	'The Taman Dhika Cluster Argopuro B7 -12, Kec. Buduran, Kab. Sidoarjo.',	'Teknik Kimia',	'Institut Teknologi Sepuluh Nop',	'3.63',	'4',	'Saya Maria Christy Widhayanti atau lebih sering dipanggil Christy merupakan seorang anak pertama perempuan yang memiliki sifat pemalu, tetapi bukan seorang introvert. Saya senang memiliki teman dan bertemu banyak orang, tetapi tidak mudah dalam mengungkapkan perasaan atau berbicara di depan banyak orang terutama orang baru. Sejak Sekolah Dasar hingga SMA, awalnya saya masih seorang pribadi yang sangat pemalu dan memiliki kebiasaan menutup diri dari orang sekitar. Namun, lingkungan perkuliahan berhasil mengubah pola pikir dan kebiasaan saya menjadi lebih baik. Ada di suatu saat dimana saya masih belum memiliki teman dekat di awal bangku kuliah, padahal sudah banyak teman-teman lain yang saling bercerita dan bermain bersama. Pada saat itu saya merenungkan dan tersadar bahwa jika saya tidak mengubah kebiasaan ini, saya akan kesulitan untuk bertahan bahkan mewujudkan mimpi-mimpi saya di kehidupan perkuliahan bahkan di dunia kerja nantinya. Jika bisa dikatakan lebih spesifik, dalam diri saya masih kurang terbentuk karakter pemuda yang teguh pendirian dan tegas karena masih adanya rasa malu untuk berkomunikasi. Jadi, hal pertama yang saya lakukan adalah berusaha aktif mengikuti kepanitiaan dan organisasi dengan tujuan untuk mengembangkan kemampuan berkomunikasi dan membangun karakter pemuda. Tahun pertama dan tahun kedua telah saya lewati dengan berbagai pengalaman kepanitiaan dan organisasi. Dengan usaha saya sendiri yang mau mencoba memberanikan diri, akhirnya saya telah mencapai tujuan saya satu per satu. Saya bisa merasakan perubahan kemampuan dalam komunikasi yang menjadi lebih percaya diri dan lancar karena cukup sering memimpin jalannya acara dengan menjadi pembawa acara dalam Bahasa Indonesia maupun Bahasa Inggris, salah satunya di acara Professional Engineering Month 2021, serta menjalin berhubungan dengan berbagai pihak sebagai humas di acara VISIT ILITS! 2021 Forda Sidoarjo. Karena saya telah mengetahui cara komunikasi yang baik, saya juga menjadi pemuda yang lebih tegas dan berani terbuka untuk berdiskusi dengan orang lain. Hal ini juga mempengaruhi pandangan saya terhadap rasa malu sehingga lebih dapat menempatkan perasaan malu di situasi tertentu. Selain itu, saya telah mengikuti Latihan Keterampilan Manajemen Mahasiswa (LKMM) yang memberikan pelatihan perencanaan dan pengonsepan acara. Dengan bantuan kemampuan komunikasi yang baik, ilmu ini dapat saya aplikasikan pada berbagai kegiatan kepanitiaan dan organisasi sehingga saya mampu merencanakan serta melaksanakan kegiatan dengan lancar. Di tahun ketiga dan keempat, sudah saatnya saya merencanakan untuk menerapkan kemampuan ini ke mimpi terbesar saya, yaitu berkuliah di luar negeri. Oleh karena itu, saya ingin mempersiapkan diri bersama dengan YBB Foundation karena fasilitas mentoring yang diberikan mampu membantu saya meraih impian ini. Selain itu, rasa untuk mengembangkan diri masih terus ada dan akan saya lakukan hingga nanti. Jadi, saya memerlukan wadah baru untuk terus menggali dan mengembangkan potensi diri. Saat inilah saya memilih YBB Foundation sebagai tempat yang tepat untuk mencari potensi diri yang masih belum saya temukan sekaligus membentuk karakter pemuda yang siap untuk menghadapi berbagai permasalahan di Indonesia maupun dunia. ',	'Setiap orang hidup dengan target, tujuan, atau mimpi yang akan memotivasi mereka untuk berjuang mewujudkannya, begitu pun dengan saya. Salah satu mimpi terbesar yang ingin saya capai dalam jangka waktu dekat ketika berkuliah adalah berkesempatan dalam mendapatkan beasiswa untuk belajar di luar negeri khususnya Korea Selatan. Alasan terbesar saya untuk berkuliah ke luar negeri adalah agar dapat melihat kondisi Indonesia dari perspektif lain dan mengamati karakter atau kebiasaan baik agar bisa menerapkannya pada diri sendiri. Dari situ, saya bisa berperan menjadi agen perubahan bersama pemuda lainnya khususnya untuk pembentukan karakter dan perkembangan teknologi di Indonesia. Bersekolah di Korea Selatan sudah saya impikan sejak di bangku SMP karena saya benar-benar tertarik dengan bahasa, budaya, kebiasaan, hingga perkembangan teknologinya. Dari situ, saya juga bermimpi untuk dapat membentuk karakter yang baik dan dengan ilmu yang didapatkan sehingga saya bisa memberikan kontribusi kepada Indonesia kelak. Mendapatkan kesempatan berkuliah ke luar negeri menjadi salah satu langkah persiapan saya untuk memasuki dunia kerja di perusahaan nasional impian saya, seperti Pertamina dan Perusahaan Gas Negara. Dengan pengalaman tersebut, saya tidak hanya mendapat hardskill dan softskill, tetapi juga relasi dalam skala internasional yang dapat membantu saya merealisasikan rencana inovasi baru untuk menghasilkan minyak dengan efektif di masa depan sehingga masyarakat Indonesia tidak lagi terkendala oleh harga minyak yang mahal. Perekonomian keluarga saya bisa dikatakan termasuk dalam golongan menengah dan berkecukupan. Namun, di usia saya yang sudah cukup dewasa ini, rasanya berat sekali jika menuntut biaya lebih kepada orang tua untuk mimpi saya sendiri. Mendapatkan beasiswa untuk berkuliah merupakan salah satu perjuangan saja juga untuk mencapai impian dengan usaha sendiri dan mendapatkan beasiswa ini dapat menjadi penghargaan atau penyemangat saya untuk mewujudkan mimpi. \r\nLangkah awal yang dapat saya lakukan adalah bermimpi. Saya sudah memiliki impian ini sejak awal perkuliahan, yaitu ingin belajar di luar negeri dengan beasiswa paling tidak 1 semester. Sejak saat itu, saya mulai mempersiapkan bekal untuk mengembangkan kemampuan, tidak hanya kemampuan Bahasa Inggris, tetapi juga kemampuan berkomunikasi dan kepemimpinan. Saya dengan sengaja mengikuti kepanitiaan atau organisasi yang bersifat Internasional atau berbasis Bahasa Inggris, seperti organisasi AIChE ITS SC yang berada dibawah naungan organisasi internasional AIChE. Selain itu, kegiatan kepanitiaan Indonesia Chem-E-Car Competition (ICECC) Chernival 2021 yang berisi perlombaan internasional balapan prototype mobil berbahan bakar reaksi kimia juga saya ikuti. Selain itu, saya memiliki cara saya sendiri untuk belajar Bahasa inggris dengan menyenangkan. Untuk membuat proses belajar tidak monoton, saya menggabungkan hobi dengan pembelajaran Bahasa Inggris. Setiap minggu saya akan memilih satu lagu baru berbahasa inggris yang kemudian akan saya mendengarkan dan menulis liriknya, kemudian membaca liriknya dan mencatat vocabulary baru, Saya juga melatih kemampuan Bahasa Inggris melalui online platform tertentu seperti Duolinggo dan berhasil mendapatkan skor Duolinggo English Test sebesar 115 untuk saat ini. Perjuangan untuk mewujudkan impian belum berakhir hingga saya mendapatkannya. Masih ada waktu selama 2 tahun di perkuliahan yang akan saya gunakan untuk mengembangkan diri dan mencari kesempatan lain. Saat inilah saya mengetahui informasi mengenai YBB Foundation dan sangat tertarik untuk menjadi bagian dari program beasiswanya. Saya memiliki keyakinan bahwa dengan adanya kesempatan untuk bergabung dalam YBB Scholarship program, saya dapat mengembangkan kemampuan melalui mentoring yang diberikan. Selain itu, sesuai dengan tujuan adanya YBB, diharapkan melalui wadah ini saya dapat membentuk mental dan karakter pemuda dalam diri saya agar siap untuk bersaing di dunia Internasional atas nama Indonesia nantinya. ',	'Ya, saya pernah bergabung dalam suatu organisasi dan berpartisipasi dalam kegiatan relawan kegiatan sosial. Menjadi salah satu bagian dari organisasi internasional American Institute of Chemical Engineers ITS Student Chapter (AIChE ITS SC) untuk mahasiswa teknik kimia ITS menjadi pengalaman yang bermanfaat bagi saya. Lingkungan kerja dalam organisasi yang sehat membuat saya nyaman bekerja dengan orang-orang di dalamnya. Saya juga merasa dapat mengembangkan kemampuan karena ada beberapa evaluasi positif yang saya terima. Adapun beberapa poin evaluasi yang terukur, yaitu Interpersonal Competency yang mewakili tanggungjawab, sikap inisiatif dan cekatan, serta memiliki pemahaman konsep acara yang baik, dimana mendapat poin sebesar 81.3%. Poin kedua adalah Critical Thinking Competency yang mewakili kemampuan analisa permasalahan kegiatan dan penyelesaian masalah yang ada dimana diberikan poin sebesar 80%. Dengan adanya evaluasi ini, saya menjadi sadar dan menemukan potensi terpendam sehingga dapat saya gali lagi di lain kesempatan. Dalam Departemen Professional Development, kami memiliki tujuan untuk membantu mengembangkan hardskill maupun softskill di kalangan mahasiswa melalui berbagai kegiatan webinar dan pelatihan. Salah satu program kerja yang saya naungi secara langsung adalah Inspirational Class 2.0. Kegiatan ini termasuk dalam pengembangan softskil karena membicarakan topik mengenai persiapan untuk memasuki dunia kerja dengan membahas tips and tricks wawancara, mengelola LinkedIn atau CV dengan menarik, dan lain sebagainya. Dalam mempersiapkan kegiatan tersebut, cukup banyak rintangan yang harus dilewati. Tidak seperti program kerja yang lain, kegiatan ini merupakan webinar online berbayar dan tanggal pelaksaannya bertabrakan dengan banyak event lain sehingga atensi peminatnya cukup menurun. Namun, saya dapat memberikan inovasi untuk melakukan promosi di platform publikasi event SejutaCita sehingga menambah atensi dari mahasiswa. Walaupun begitu, saya dapat dikatakan berhasil menyelenggarakan kegiatan tersebut dengan lancar karena meskipun dengan kuantitas peserta yang kecil, ternyata dapat menghasilkan kualitas peserta yang baik. \r\nTidak hanya aktif di organisasi saja, saya juga cukup tertarik untuk melakukan kegiatan sosial. Setiap tahunnya, Himpunan Mahasiswa Teknik Kimia (HIMATEKK) ITS mengadakan kegiatan bernama Sosdev Goes to Street (SGS) yang berupa kegiatan membagikan bantuan sembako kepada masyarakat yang membutuhkan dimana target utamanya adalah masyarakat di kampung binaan yang dikelola HIMATEKK. Pada tahun 2021, kegiatan ini nyaris tidak dapat dilaksanakan karena terhalang pandemi. Namun, tercipta cara unik untuk tetap menyalurkan kepedulian terhadap sesama yang membutuhkan. Target utama saat itu beralih kepada para ojek online sehingga sembako berupa makanan atau minuman saya salurkan melalui antar pesan secara online, seperti GoFood atau ShopeeFood. Hal ini membuat saya sadar jika hal kecil yang saya bagikan kepada orang lain, dapat memiliki arti besar bagi orang lain. Walaupun belum banyak kegiatan relawan yang saya lakukan, tetapi saya memiliki rencana untuk mengadakan kegiatan sosial bagi masyarakat yang berada di sekitar Pasar Sono Sidoarjo. Dengan kemampuan pengelolaan event yang saya miliki, saya yakin dapat menyediakan wadah dimana mahasiswa maupun pemuda di sekitar dapat bergabung degan sukarela untuk menyukseskan kegiatan sosial tersebut. Selain itu, dengan begabungnya saya dengan YBB Foundation, saya harap dapat belajar banyak mengenai bagaimana proses mempengaruhi para pemuda agar dapat sama-sama bergerak dalam banyak kegiatan sosial. ',	1,	1655697243,	NULL,	0),
('SCHLR-MRDMN-f1b353',	'USR-MRDMN-3edc3',	'Maria Dominika Wona Lewa',	'2002-05-14',	'81339621974',	'Jl. Perintis Kemerdekaan I, Kayu Putih. Kota Kupang, Provinsi NTT',	'Ilmu Kesehatan Masyarakat',	'Universitas Nusa Cendana',	'3.47',	'4',	'Saya adalah seorang mahasiswi di salah satu universitas negeri yang ada di Provinsi NTT,saya mengambil jurusan kesehatan masyarakat,saya tinggal bersama ayah dan dua saudara saya',	'Saya ingin menjadi salah satu relawan dari your break bonduries yang dapat berkontribusi dalam mewujudkan impian anak bangsa dalam dunia pendidikan dan kesehatan. Dan menjadi seorang ahli kesehatan masyarakat yang memiliki kontribusi besar dalam mencegah masalah kesehatan dilingkungan masyarakat terkhususnya masalah kesehatan lingkungan.',	'Belum',	1,	1655039980,	NULL,	0),
('SCHLR-MRDNY-44c020',	'USR-MRDNY-b68bd',	'Maria Adnyana Dentang Krisnasari ',	'2004-05-14',	'81326027051',	'Mutiara gading blok i ',	'MIPA',	'SMAN 11 SEMARANG ',	'0.00',	'0',	'Saya Maria Adnyana Dentang Krisnasari akrab dipanggil Tata, saya berumur 18 tahun dan saat ini akan menempuh pendidikan di perguruan tinggi. Saya pribadi yang ramah, open minded dan sangat suka mencoba hal baru, tak hanya itu saya juga suka bekerjasama dalam organisasi / Tim, sejauh ini saya tidak hanya mengembangkan potensi akademik melainkan juga non akademik saya. ',	'mimpi terbesar saya bisa menjadi seorang dokter spesialis mata sekaligus dosen. Cara saya untuk mewujudkan nya saya belajar giat, saya aktif mencari wawasan baru serta beasiswa untuk menunjang kuliah saya nanti, serta saya semakin aktif mencari info serta pelajaran yang dapat menunjang mimpi saya tersebut\r\n',	'Iya saya punya, sewaktu SMA saya dipercaya menjadi Ketua OSIS SMAN 11 Semarang periode 2020 / 2021 sekaligus ketua Pentas Seni Evolution 2021, saya juga menjadi koordinator bidang kepemimpinan di FKO (Forum Komunikasi OSIS) Kota Semarang. Selama saya menjabat event-event terlaksana dengan lancar, semua anggota bersinergi untuk mewujudkan program kerja. ',	1,	1654657803,	NULL,	0),
('SCHLR-MRDWY-775f42',	'USR-MRDWY-81533',	'Maura Dewy Purwana ',	'2001-03-11',	'89687524613',	'Desa Bandungkidul kecamatan bayan Kabupaten Purworejo provinsi Jawa tengah ',	'Manajemen/Ekonomi ',	'Universitas Muhammadiyah Purwo',	'3.30',	'4',	'Sebelumnya perkenalkan nama saya Maura Dewy, saya seorang mahasiswa aktif di salah satu universitas di kota Purworejo, keikutsertaan saya sebagai mahasiswa bukanlah hanya kupu kupu (kuliah pulang)  saya menjadi aktivis di kampus sejak semester 3, dari awal pengalaman saya, saya belajar berbagai skill yang sangat berguna bagi saya, saya memiliki ketertarikan untuk mempelajari hal baru serta senang mengupgrade diri ini menjadi lebih baik, seperti saya mengikuti beasiswa ini saya berminat sekali, karena akan dapat pengalaman menarik ketika saya mengikuti beasiswa ini. Berbicara tentang diri sendiri saya juga senang dalam membuat karya puisi, berbicara di depan umum seperti berpidato dan saya juga pernah menjadi MC diacara kampus saya, hal hal kecil seperti itu yang membuat saya ingin terus belajar mengali potensi yang ada pada diri saya.',	'Mimpi terbesarku adalah bisa membangun sebuah usaha yang bergerak di bidang food and beverage, berbicara tentang bagaimana mewujudkannya, cara saya sangat klasik mungkin, akan tetapi lumayan berat dijalani oke yang pertama saya belajar teori nya dahulu tentang bagaimana berbisnis berhubung mata kuliah yang saya ambil mayoritas bisnis jadi saya belajar teorinya dari itu, lalu secara praktek selain kuliah saya juga bekerja di bidang food dan beverage juga, dari situ saya bisa melihat sekaligus memahami langsung setiap tindakannya hal itu membuat saya semakin yakin akan saya bisa mewujudkan mimpi saya selain teori dan praktek sedikit demi sedikit saya pelajari setidaknya modal juga saya persiapkan lebih awal untuk pengembangan usaha saya nantinya ',	'Saya memiliki pengalaman organisasi di kampus saya, saya mengikuti HIMA MANAJEMEN dan Himpunan pengusaha muda Indonesia, dalam kedua organisasi yang saya ikuti tersebut saya banyak belajar hal baru seperti misalnya publik speaking saya yang semakin bagus, lalu kemampuan leadership saya yang baik, selain itu banyak ilmu baru yang saya dapat di organisasi itu, yang tidak saya dapatkan ketika saya hanya mengikuti kelas saja.\r\nLalu ketika di himpunan pengusaha muda Indonesia saya belajar bagaimana menjadi entrepreneur yang baik dan strategi apa yang harus kita tahu ketika kita ingin membuat usaha, dan dari himpunan tersebut banyak ilmu yang saya dapatkan apalagi ilmu entrepreneurship  dan hal baru yang lainya . Serta selain pengalaman saya juga mendapatkan relasi baik dari dalam kampus maupun luar kampus',	1,	1653573943,	NULL,	0),
('SCHLR-MRKRS-91c0e6',	'USR-MRKRS-27598',	'Maria kristiana Daul',	'2004-01-24',	'82255158870',	'Bangkakeli, desa Hilihintir, kecamatan Satarmese Barat',	'MIA',	'SMA Negeri 1 Satarmese',	'3.14',	'5',	'Saya merupakan gadis dari Timur Indonesia tepatnya di pulau Flores, yang berencana untuk melanjutkan pendidikan di tanah orang demi mewujudkan cita-cita saya sendiri serta harapan dari orangtua. Semasa SMA saya aktif dalam kegiatan organisasi dan beberapa kali dipercayakan sebagai ketua panitia bila ada kegiatan yang dilaksanakan di sekolah. Saya juga pernah mengikuti lomba sains tingkat sekolah dan menang yakni saat kelas X dan kelas XI. Dan akhir-akhir ini saya sering mengikuti kegiatan perlombaan Sains yang dilaksanakan secara online dan Puji Tuhan saya mendapatkan beberapa medali. \r\nKelebihan saya yang pertama yaitu memiliki publik speaking yang bagus, sehingga dipercayakan menjadi moderator maupun MC, kedua, tingkat kepercayaan diri yang tinggi, dan terakhir termasuk pemimpin(organisasi) yang hebat. \r\nKekurangan saya adalah kurang mampu menguasai bahasa asing. Namun saya tetap belajar lewat media sosial yakni YouTube. Kemudian saya juga kurang mampu menguasai pemrograman tetapi saya akan memperlajari hal tersebut ketika nanti kuliah, karena sekarang saya tidak mempunyai laptop. Yang ketiga adalah pelupa, tetapi saya sering mengetik segala sesuatu di HP saya supaya mengurangi resiko akibat rasa lupa yang ada dalam diri saya.\r\nSaya memiliki harapan yang besar untuk membanggakan kedua orangtua saya dengan prestasi yang akan saya dapatkan di waktu yang akan datang.',	'Impian terbesar saya adalah menjadi seorang analyst data disebuah perusahaan baik itu swasta ataupun negeri. Sehingga nanti gaji yang saya dapat dari pekerjaan saya itu dapat saya berikan kepada kedua orangtua saya, karena kondisi mereka juga tidak memungkinkan untuk terus bekerja, serta saya memiliki harapan jika nanti ada rezeki yang cukup dari hasil pekerjaan saya maka akan saya salurkan kepada orang-orang yang membutuhkan terutama untuk anak-anak yang bersekolah namun ekonomi orangtuanya kurang mendukung. Dan saya akan membantu membelikan perlengkapan sekolah serta membiayai pendidikan mereka. \r\nCara saya untuk mewujudkan hal tersebut tentu dengan rajin belajar agar dapat menyelesaikan kuliah tepat waktu, kemudian membangun relasi dengan pihak manapun yang dapat membantu saya meningkatkan potensi yang ada dalam diri saya.',	'Organisasi yang pertama yang saya ikuti adalah OSIS. Dalam organisasi tersebut saya menjabat sebagai ketua bidang jurnalistik dan publikasi periode 2020/2021. Tidak banyak kegiatan yang kami laksanakan selama saya bergabung dalam bidang tersebut dikarenakan pada saat itu pembelajaran dilaksanakan dari rumah karena covid-19. Organisasi kedua yang saya ikuti adalah Organisasi Ekstrakulikuler pilihan PersSmansa Narang. Dari namanya saja kita sudah paham bahwa organisasi bergerak dalam bidang jurnalistik. Tahun 2020/2021 saya menjabat sebagai sekretaris dan pada tahun 2021/2022 saya menjabat sebagai ketua organisasi tersebut. Ada banyak kegiatan yang kami lakukan selama tahun saya kelas XII. Kalau tahun pada saat kelas X dan XI masih kurang, karena pada saat itu terkendala oleh covid-19 juga. Kegiatan yang kami lakukan yaitu webinar Online dengan beberapa lembaga misalnya Unika Soegijapranata Semarang, kemudian turut tergabung dalam kegiatan Calon Guru penggerak, dan pada bulan Mei lalu saya mewawancarai bupati Manggarai dan itu merupakan sebuah kebanggaan bagi saya.',	1,	1655741117,	NULL,	0),
('SCHLR-MRPRM-776a38',	'USR-MRPRM-68b5f',	'Mira Permata Sari',	'2002-08-18',	'85855453070',	'Jl. Dieng Atas, Dusun Karang Tengah, RT/RW 01/01, Desa Karangwidoro, Kecamatan Dau, Kabupaten Malang.',	'Prodi Matematika Fakultas Sain',	'Universitas Islam Negeri Maula',	'3.45',	'1',	'perkenalkan nama saya Mira Permata Sari. Saya biasa dipanggil dengan Mira. Saya adalah mahasiswi semester 2 prodi Matematika di UIN Malang. Seseorang yang disiplin, tidak suka menunda-nunda pekerjaan, pendiam, tetapi saya suka aktif dalam organisasi maupun lingkungan sekitar saya. Saya adalah orang yang to the point atau tidak suka bertele-tele, saya suka mendengarkan cerita teman saya maupun memberi saran yang terbaik. Saya lebih suka action yang secara diam-diam. Daripada berbicara banyak tetapi tidak ada tindakan apapun. Saya terlahir dari keluarga biasa, dengan cita cita menjadi pengusaha serta dosen. Saya ingin membanggakan kedua orang tua saya melalui apa yang saya ikuti dan kuliah untuk mencapai pendidikan yang tinggi. ',	'Saya ingin menjadi wanita karier (pengusaha dan dosen). Cara saya mewujudkan cita-cita saya adalah ikut turut aktif, belajar yang rajin, mengambil keputusan untuk mencoba hal baru, menambah pengalaman, relasi. Apapun yang dapat mewujudkan cita-ita saya melalui hal positif akan saya lakukan. Disamping itu saya sudah mulai merancang apa yang akan saya lakukan kedepannya. Seperti di tahun ini saya mulai menjadi tentor serta berjualan online yaitu fashion.',	'Ya saya memiliki pengalaman organisasi atau relawan. Pengalaman organisasis saya dimulai sejak SMA yaitu \r\n1. Sekertaris Dewan Keamanan Sekolah di SMA Laboratorium UM Malang\r\nDisana saya menjadi sekertaris, yang membuat surat menyurat, proposal, TOR, Kode etik, Pakta Integritas, Surat kegiatan dan yang lainnya. Pengalamn yang saya dapat selama menjadi sekertaris adalah lebih bisa teliti serta gaya kepenulisan yang lebih baik dari sebelumnya. kegiatan yang dilakukan oleh organisasi ini yaitu mengamankan sekolah, dimana akan ada razia seperti Make up, rokok, vape, dan barang yang tidak diperbolehkan dibawa ke sekolah. DK juga berperan dalam mengamankan jalannya kegiatan yang ada di sekolah maupun luar sekolah yang masih menggunakan seragam dimana itu membawa nama baik sekolah. \r\n\r\n2. Organisasi yang ada di Kampus \r\nyaitu PMII (Pergerakan Mahasiswa Islam Indonesia) disana saya masih sebagai anggota atau kader. Banyak hal juga yang sudah saya dapat dari organisasi ini yaitu keakraban, meningkatkan public speaking melalui debat saat kegiatan berlangsung dan kepercayaan diri. \r\n\r\n3. Organisasi luar kampus \r\nPenggerak Perdamaian Duta Damai Jawa Timur\r\nDisini saya mendapatkan banyak hal yang tidak saya dapat di kampus, dimana disini kita organisasi duta damai yaitu menyebarkan konten-konten positif, bagaimana membedakan berita hoax dan fakta, menghargai perbedaan yang ada, mencegah penyebaran konten-konten yang mengandung radikalisme dan terorisme serta informasi atau berita palsu (hoaks). Duta damai ini dibawah naungan BNPT Jatim.',	1,	1654514276,	NULL,	0),
('SCHLR-MRSSK-948704',	'USR-MRSSK-82708',	'Marsi Sekar Ningrum',	'2002-03-05',	'81372445218',	'Jalan Bidin Muhammad Batuah, Dusun Padang Malintang, Desa Santur, Kecamatan Barangin, Kota Sawahlunto, Provinsi Sumatera Barat ',	'S1 Ilmu Keperawatan/Fakultas K',	'Universitas Andalas ',	'3.69',	'3',	'Saya adalah mahasiswi keperawatan semester tiga. Saya memegang tinggi disiplin dan tanggung jawab. Saya dapat membagi waktu secara baik,  Saya aktif berorganisasi dan tetap mendapatkan nilai akademik yang baik.',	'Saya ingin menjadi perawat profesional, yang tidak hanya merawat secara langsung, namun juga menjadi promotor dan edukator guna peningkatan angka kesehatan di Indonesia. Untuk itu, saya memerlukan banyak ilmu pengetahuan dan keterampilan, saya akan belajar semaksimal mungkin dan meraih hasil yang terbaik.',	'Ya. Saya aktif berorganisasi baik dalam lingkup fakultas maupun universitas. Saya juga sering menjadi relawan terutama di bidang kesehatan. Saya telah sukses menjalankan banyak program kerja di organisasi, dan juga menjadi relawan.',	1,	1654762169,	NULL,	0),
('SCHLR-MSBH-ab56a7',	'USR-MSBH-dac56e',	'Misbahusudur',	'1996-02-08',	'85794825532',	'Jl.wanajaya - blok kamis - babakan tarikolot',	'Penjas/pjkr/fkip',	'Universitas majalengka',	'3.98',	'4',	'Perkenalkan nama saya misbahusudur seorang pelajar yang sederhana yang di mulai sejak masa smp sampai aliyah tidak memberatkan biaya sekolah kepada orang tua tapi di biayai oleh sekola karna keluarga saya perekonomiannya menengah ke bawah,saya kuliah awal nya di biayai oleh keluarga pondok pesantren tapi untuk selanjutnya biaya kuliah di tanggung sendiri sama bantuan dari orang tua.',	'Mimpi terbesarku adalah menjadi orang sukses yang penuh dalam keberkahan,untuk mewujudkannya yaitu dengan berusaha dan berdo\'a tak lepas dari do\'a kedua orang tua',	'Sewaktu aliyah dulu pernah mengikuti ke organisasian osis sebagai anggota osis',	1,	1654261639,	NULL,	0),
('SCHLR-MTHNB-5d0461',	'USR-MTHNB-076ab',	'Muthi Nabila Rachman',	'2002-07-11',	'82210752749',	'Bogor Raya Permai Blok FBX 1 No. 20 A, Kelurahan Curug, Kecamatan Bogor Barat, Kota Bogor. 16113',	'Kimia FMIPA',	'Universitas Indonesia',	'3.43',	'4',	'Saya adalah mahasiswa Universitas Indonesia semester 4 Jurusan Kimia yang aktif, berdedikasi tinggi, kompeten, dan penuh ambisi dalam meningkatkan kualitas diri khususnya melalui kegiatan magang, organisasi, dan kepanitiaan. Melalui pengalaman yang sudah saya lalui baik sebagai seorang pemimpin maupun bagian dari sebuah tim, saya memiliki kemampuan dan ketertarikan yang tinggi di bidang Administrasi dan Marketing terutama di lingkup Partnership. Saya memiliki intrapersonal skill yang baik, mengerjakan sesuatu dengan rapi, terstruktur, dan tepat waktu.',	'Mimpi terbesar saya adalah memiliki perusahaan industri skincare dan kosmetik milik saya sendiri yang sukses, terkenal, dan dapat memberikan manfaat bagi banyak orang terutama yang membutuhkan. Sudah hampir 2 tahun saya berkuliah dengan kondisi daring, yang membuat aktivitas yang seharusnya dilaksanakan secara luring seperti kegiatan praktikum di laboratorium terhambat, dan praktikum baru dilaksanakan secara luring pada bulan Maret 2022 lalu. Sehingga dengan kondisi saya yang sudah menempuh semester 4 ini dapat dikatakan skill lab yang saya miliki masih kurang, dan hal ini dapat mempengaruhi rencana karir yang saya punya. Sehingga, rencananya di semester 5 saya akan mengambil program kampus merdeka lintas jurusan Farmasi dan mengambil mata kuliah praktikum disana untuk meningkatkan skill lab yang saya punya dan mempelajari mata kuliah farmasi, obat-obatan. Di semester 6 saya akan mengambil program magang kampus merdeka di PT Paragon Technology and Innovation bagian Research and Development dan melanjutkan karir saya disana sekaligus mempelajari hal-hal yang dapat saya pelajari untuk membangun bisnis skincare dan kosmetik. Tentunya untuk mencapai mimpi yang saya punya memerlukan waktu dan perjalanan yang panjang dalam mempelajari berbagai hal dan menyusun segala hal yang perlu disiapkan, yang pasti saya akan terus berusaha, terus memperbarui perencanaan langkah-langkah yang harus saya jalani, dan membulatkan tekad yang saya punya agar dapat selalu konsisten dan berprogres.',	'elama kuliah saya mengikuti berbagai organisasi dan kepanitiaan di bidang administrasi dan sponsorship. Dari 3 organisasi yang pernah saya jalani, saya berhasil mendapatkan predikat staf terbaik dari 2 diantaranya. Selain organisasi dan kepanitiaan, saya juga mengikuti magang di bidang partnership selama kurang lebih 4 bulan. Dari 560+ kontak target mitra yang saya hubungi, saya berhasil mendapatkan persetujuan kegiatan kolaborasi sekaligus sponsorship dari 2 perusahaan besar, dan total lebih dari 100 slot media partner yang saya dapatkan, saya juga ditetapkan sebagai peserta magang terbaik di bidang partnership. Meskipun saya memiliki banyak kegiatan non akademik, saya tetap dapat mempertahankan ipk saya di atas 3.',	1,	1654429938,	NULL,	0),
('SCHLR-MTHNB-bdbb7c',	'USR-MTHNB-db6f2',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654080540,	NULL,	0),
('SCHLR-MTRSK-92a199',	'USR-MTRSK-0c0ab',	'Mutiara Sakinah',	'2003-08-06',	'81245411864',	'Jl. Santo Pedro, No. 18, Kel. Ngade, Kota Ternate',	'Teknik Pertanian',	'University Jenderal Soedirman',	'3.62',	'1',	'saya anak yang menyukai hal baru, saya bertekad menjadi anak rantauan sejak SMP karena saya ingin melihat dan mengenal dunia luar serta belajar agar dapat bertahan hidup dan beradaptasi dengan dunia baru yang saya pijakan.',	'mimpi terbesar ku adalah melihat kedua orang tua ku bangga dengan hasil pencapaian ku dan cara ku mewujudkan ini adalah berusaha sekuat tenaga dalam setiap hal dan mencoba sesuatu yang baru',	'walaupun pengalaman organisasi saya sedikit namun pengalaman kepanitiaan sangat banyak dan beragam mulai dari panitia tingkat universitas ataupun tingkat kabupaten, ragamnya kepanitian ini pun dirasakan setelah saya menjadi anak rantau dan hal yang tidak terlupakan dari panitia yang saya ikut adalah ketika pertama kali datang ke purwokerto saya langsung menjelajah hingga ke purbalingga karna tugas kepanitian itupun saya nikmati tanpa beban karna selama perjalanan ke purbalingga saya melihat banyak hal baru yang belum pernah saya lihat dan hal ini dapat saya lakukan dengan menyesuaikan dengan waktu kuliah.',	1,	1655706335,	NULL,	0),
('SCHLR-MTZHB-c024c4',	'USR-MTZHB-13101',	'Imtiaz Habib Lubis',	'2002-05-22',	'8516972230',	'Jl.H Imam Munandar Jl.Pesantren no.2',	'Teknik Industri',	'Universitas Muhammadiyah Malan',	'3.88',	'2',	'Nama saya imtiaz habib lubis saya berasal dari Pekanbaru Provinsi Riau, Saya adalah mahasiswa perantauan di malang provinsi jawa timur,saya sangat hobby dalam melakukan kegiatan sosial,saat saya masih sma saya mengikuti organisasi keislaman serta aktif mengikuti beberapa Olimpiade namun sayang saya masih belum rezeki untuk memenangkan olimpiade,saat ini di Universitas saya mengikuti Sebuah Lembaga Semi Otonom yaitu kelompok belajar dari fakultas teknik.Saya adalah orang yang dapat memanajemen waktu dengan baik,dapat fokus terhadap suatu pelajaran,dan senang bersosialisasi,saya juga orangnya senang belajar hal yang baru dan suka hal yang unik yang berbeda dengan kebanyakan orang lain.Tujuan saya mengikuti beasiswa ini disamping benefit yang ditawarkan adalah agar saya dapat berkontribusi di kegiatan diluar kampus dan memiliki banyak koneksi sosial agar impian saya dan untuk orang banyak tercapai.',	'Mimpi saya terbesar adalah dapat berkuliah atau melanjutkan pendidikan di luar negri,cara untuk mewujudkannya tekun belajar,melakukan kegiatan yang dapat mendukung,serta memperbanyak mempelajari pengalaman dari orang yang sudah berpengalaman.',	'Untuk Organisasi Di kampus saya mengikuti Lembaga Semi Otonom yaitu sebuah organisasi yang membentuk kelompok belajar fakultas teknik,saya juga pernah mengikuti organisasi keagamaan ketika SMA,untuk relawan sendiri saya pernah menjadi relawan ketika SMA di provinsi riau Ketika kebakaran hutan terjadi,dengan kegiatan pemberian masker serta edukasi kepada masyarakat.',	1,	1653470940,	NULL,	0),
('SCHLR-MWRZZ-65a6e1',	'USR-MWRZZ-c0e40',	'Mawar Azzahra',	'2003-03-08',	'81244685140',	'Dusun Kaemba\r\nDesa Pabentengang\r\nKec. Marusu Kab. Maros',	'IPS',	'SMA Negeri 9 Maros',	'9.86',	'6',	'# Penjelasan Tentang Biodata Diri\r\n\r\nPerkenalkan, nama lengkap saya adalah Mawar Azzahra biasa di panggil Mawar, saya lahir di Maros, 08 Maret 2003 dari pasangan suami istri Nasaruddin dan Wati. Usia saya saat ini telah beranjak 19 tahun, hobi saya sehari-hari adalah bernyanyi. Saat ini saya tinggal di Desa Pabentengang yakni suatu desa yang berada di kecamatan Marusu, kabupaten Maros, provinsi Sulawesi Selatan.\r\n\r\n# Penjelasan Tentang Riwayat Pendidikan\r\n\r\nSaat ini, saya baru saja lulus dari SMA, kurang lebih 14 tahun saya menempuh dunia pendidikan. Selama 2 tahun saya telah menempuh pendidikan di taman kanak-kanak yang bernama TK Handayani, selanjutnya saya melanjutkan pendidikan Sekolah Dasar di SD Negeri 137 Inpres Kaemba 1 selama 6 tahun lamanya, setelah itu, saya kembali melanjutkan pendidikan Sekolah Menengah Pertama selama 3 tahun di SMP Negeri 9 Marusu, dan yang terakhir saya melanjutkan pendidikan Sekolah Menengah Atas di SMA Negeri 9 Maros selama 3 tahun. Dan saat ini status saya adalah calon mahasiswa baru di Universitas Negeri Makassar.\r\n\r\n# Penjelasan Tentang Prestasi Yang Telah Di Capai\r\n\r\nSaat menempuh pendidikan di taman kanak-kanak saya pernah meraih peringkat ke 3 namun seiring berjalannya waktu peringkat saya tersebut menurun ke peringkat 4 dan pada akhirnya lambat laun karena malas belajar, saya pun tidak berhasil masuk ke peringkat 5 besar.\r\n\r\nSelanjutnya, saat duduk di bangku sekolah dasar mulai dari kelas 1 hingga kelas 3 dalam ingatan, saya tidak pernah masuk kedalam peringkat 10 besar, baru pada saat kelas 4 semester 1 saya berhasil meraih peringkat 6 di kelas namun setelah saat itu saya tidak pernah lagi masuk ke peringkat 10 besar hingga lulus dari sekolah Dasar.\r\n\r\nKarena hidayah Allah yang di datangkan melalui mulut ibu, saya pun bertobat dan memfokuskan diri untuk belajar keras di SMP, alhasil saya berhasil mendapatkan peringkat 3 saat duduk di kelas VII semester 2. Setelah saat itu saya tidak pernah lagi mengetahui peringkat saya karena sekolah memutuskan untuk menghapuskan sistem perengkinan/pemeringkatan siswa di kelas jujur saya sangat kecewa dengan hal itu namun kecewa saya tidak membuat semangat saya surut untuk belajar lebih keras lagi.\r\n\r\nSebelum masuk ke sekolah menengah atas, saya benar-benar telah memantapkan di dalam hati untuk lebih dan lebih lagi belajar dengan keras, hal ini saya lakukan karena ambisi saya untuk masuk ke peringkat umum saat di SMA, kala itu saya hanya berharap untuk meraih peringkat 3 atau 2 umum saja saya sudah sangat bangga dan bersyukur, tetapi rezeki Allah berkata lain saya Alhamdulilah di beri rezeki yang luar biasa oleh Allah, alhasil dengan modal ambisi dan belajar dengan keras serta doa saya pun berhasil meraih juara 1 umum untuk program IPS karena kebetulan di SMA saya mengambil jurusan IPS.\r\n\r\nSelama 3 tahun 6 semester bersekolah di SMA, saya sebanyak 4 kali berturut-turut Alhamdulilah berhasil meraih juara 1 umum di jurusan saya,hal ini merupakan pencapaian pertama terbesar dalam sejarah hidup saya. Selain itu peringkat saya di dalam kelas juga Alhamdulillah tidak pernah menurun. Selama 6 semester di sekolah Alhamdulilah saya peringkat 1 terus di kelas ini benar-benar menjadi kebanggaan tersendiri bagi saya.\r\n\r\nSelain di dalam lingkungan sekolah, saya juga pernah berhasil meraih prestasi di luar lingkungan sekolah, saya pernah mengikuti suatu Kompetisi Sekolah yang di adakan oleh suatu universitas ternama di Sulawesi Selatan, Alhamdulilah saya bersama teman berhasil meraih juara 1 Lomba Essay & Multiple Choice dan di lomba individu, Alhamdulillah saya juga berhasil meraih juara 2 Lomba Siklus Akuntansi, hal ini merupakan pencapaian terbesar kedua dalam hidup saya dan sangat berharap akan terjadi lagi kedepannya untuk pencapaian ke ketiga selanjutnya Aamiin Aamiin Aamiin Allahumma Aamiin ya Allah ????????.\r\n\r\n# hal yang dapat di banggakan dari diri saya yakni :\r\n\r\n- Prestasi yang saya miliki. Selama saya duduk di bangku SMA, peringkat saya di kelas tidak pernah menurun, Alhamdulilah saya rangking 1 terus hingga lulus. Bahkan, saya juga sudah 4 kali berturut-turut menjadi juara Umum 1 program IPS semester ganjil dan genap.\r\n- Saya berhasil terpilih dan di nobatkan menjadi Siswa Terbaik 1 IPS Angkatan 14\r\n- Saya memiliki kepercayaan sepenuhnya terhadap diri sendiri, tidak pernah pesimis dan tidak pernah berprasangka buruk terhadap diri sendiri\r\n- Saya mampu mengambil keputusan yang baik untuk diri sendiri dengan bijak, oleh karena itu pondasi yang ada di diri saya selalu kuat dalam menghadapi segala rintangan hidup\r\n- Saya pandai meyakinkan seseorang tanpa menyakiti perasaannya, sebab setiap kata yang keluar dari mulut selalu di pertimbangkan dengan baik sebelum di ungkapkan, baik itu secara lisan maupun tulis\r\n- Saya sangat fokus dan serius dalam mencapai tujuan hidup\r\n- Saya memiliki prinsip diri yang kuat\r\n- Saya tidak mudah menyerah dalam menghadapi segala rintangan hidup saya\r\n- Saya selalu energik dalam menjalani sesuatu \r\n- Saya selalu dibutuhkan saat berdiskusi untuk berpendapat\r\n- Saya selalu di andalkan dalam kelompok\r\n- Saya dapat memberikan pendapat atau saran kepada orang lain dengan penuh kebijaksanaan, oleh sabab itu, saya selalu di mintai pendapat oleh orang lain tentang sesuatu yang perlu di pecahkan\r\n- Saya memiliki kepercayaan diri yang baik dan itu tidak berlebihan\r\n- Saya dapat menjadi orang yang amanah atau seseorang yang di percayai oleh orang lain karena saya memiliki sifat jujur\r\n- Saya selalu memberikan dan menunjukkan hal-hal yang positif kepada orang lain\r\n- Saya dapat menjadi support system dan memberikan motivasi yang membangun kepada diri sendiri dan orang lain\r\n- Saya dapat menjadi orang yang sangat kuat jika sudah berprinsip dan berkomitmen terhadap diri sendiri\r\n- Saya bisa menjadi sosok yang menginspirasi banyak orang \r\n\r\n# Pengalaman yang paling membanggakan saya adalah :\r\n\r\n- Meraih juara 2 Lomba Makan Kerupuk di \r\nkampung saat perayaan 17 Agustus hari kemerdekaan Republik Indonesia.\r\n\r\nSaya sangat bangga dengan pengalaman pertama saya ini sebab hal ini adalah pengalaman pertama saya mengikuti lomba, saking semangatnya saya mengikuti lomba Makan Kerupuk ini pada malam harinya sebelum lomba, saya berusaha mencabut gigi saya sendiri yang sudah goyang. Hal ini saya lakukan agar saya dapat melaksanakan lombanya dan usaha yang maksimal.\r\n\r\n- Mengikuti perlombaan gerak jalan di SMP\r\n\r\nMeskipun kami tidak juara dalam lomba ini, tetapi saya sangat bangga karena tim gerak jalan kami tetap semangat dan pantang menyerah hingga ke garis finish melakukan penampilan gerak jalan yg terbaik.\r\n\r\n- Meraih peringkat 3 saat kelas VII di SMP\r\n\r\nPengalaman ini tidak akan pernah terlupakan sebab pada saat itu, untuk pertama kalinya saya masuk 3 besar dalam perengkinan di kelas.\r\n\r\n- Meraih juara 1 umum program IPS di SMA\r\n\r\nPengalaman saya ini juga tidak akan pernah terlupakan sebab hal ini adalah pencapaian terbesar dalam hidup saya, bukan hanya juara kelas, bahkan saya pun berhasil meraih juara 1 umum di luar kelas dan ini merupakan hal yang sangat tidak mudah bagi saya\r\n\r\n- Meraih peringkat 1 di kelas saat SMA mulai dari semester satu hingga semester akhir\r\n\r\nAlhamdulillah, dari kelas 1 hingga kelas 3 SMA saya bisa terus mempertahankan peringkat saya di dalam kelas yakni peringkat 1 Alhamdulillah\r\n\r\n- Meraih juara umum 1 di Kompetisi Akuntansi Siswa Tingkat SMA Se-Sulawesi untuk Tim/Kelompok\r\n\r\n- Meraih juara 1 Lomba Essay & Multiple Choice di Kompetisi Akuntansi Siswa Tingkat SMA Se-Sulawesi\r\n\r\n- Meraih juara 2 Lomba Siklus Akuntansi di Kompetisi Akuntansi Siswa Tingkat SMA Se-Sulawesi\r\n\r\n- Di nobatkan sebagai Siswa Terbaik 1 IPS Angkatan 14\r\n\r\n# Kelebihan\r\n\r\n- Selalu Optimis Dalam Belajar\r\n\r\nDalam belajar maupun menuntut ilmu saya selalu menjunjung tinggi sikap optimis, saya tidak pernah mengeluh dan berfikiran buruk tentang usaha yang saya lakukan dalam mempelajari ilmu apapun itu sebab, saya percaya bahwa apapun yang saya lakukan hari ini akan berbuah manis untuk diri saya di hari kemudian karena yang saya lakukan itu sudah baik dan benar.\r\n\r\n- Mampu menguasai semua mata pelajaran di sekolah\r\n\r\nSelama bersekolah, bisa di bilang saya selalu berhasil meraih nilai yang tinggi. Hampir di semua mata pelajaran saya kuasai. Saya selalu memaksa diri saya untuk terus belajar. Hal ini saya lakukan sebab saya memiliki ambisi yang besar untuk menjadi juara kelas.\r\n\r\n- Rajin belajar dan Selalu semangat dalam menuntut ilmu.\r\n\r\nSelama saya bersekolah saya sangat rajin belajar, bisa di bilang hal ini terjadi karena jiwa semangat belajar yang tertanam di dalam diri saya. Apapun mata pelajaran nya saya hadapi dengan ikhlas tanpa mengeluh. Saya menganggap semuanya sama oleh karena itu harus di hadapi dan di jalani semuanya dengan baik dan semaksimal mungkin.\r\n\r\n- Mampu bergaul dengan siapa saja.\r\n\r\nDi sekolah saya mampu mengenal semua teman. Dalam bergaul, saya tidak pernah sama sekali memilih milih teman karena saya menanggap semuanya sama.\r\n\r\n-  Memiliki jiwa pantang menyerah.\r\n\r\nDalam menghadapi ujian hidup yang kadang menjatuhkan mental saya ke bawah, saya selalu berusaha untuk menerimanya dengan lapang dada, namun setelah itu yang saya lakukan tidak diam di tempat, tetapi saya justru kembali bangkit untuk bisa berada di atas lagi, sebab saya percaya bahwa hidup itu seperti roda yang terus berputar.\r\n\r\nInilah sekiranya penjelasannya tentang diri saya, sekian dan terimakasih banyak atas perhatiannya, Wassalamu\'alaikum warahmatullahi wabarakatuh ????\r\n\r\n\r\n\r\n\r\n',	'Saya memiliki mimpi terbesar yakni menjadi seorang akuntan yang hebat, cara saya untuk mewujudkannya adalah dengan terus belajar dengan giat dan memperdalam ilmu akuntansi, selain itu saya juga melanjutkan pendidikan ke perguruan tinggi negeri dengan mengambil jurusan akuntansi di Universitas Negeri Makassar. Selain itu, saya juga memiliki mimpi untuk menjadi sosok yang bermanfaat dan menginspirasi untuk banyak orang oleh sebab itu mulai saat ini saya belajar untuk mengolah publik speaking saya agar dapat berbicara di depan kamera dengan baik dan memberikan motivasi kepada banyak orang.',	'Saya memiliki pengalaman organisasi selama di sekolah yakni di :\r\n- Ekskul Paskibra\r\n- Ekskul Sanggar Seni dan\r\n- Ekskul Saintek Kebumian\r\nSelain itu, di luar sekolah saya juga memiliki pengalaman organisasi yakni,\r\n- Menjadi anggota Remas (Remaja Masjid) Nurul Amin\r\n\r\nCerita pengalaman,\r\n\r\n- Ekskul Paskibra\r\n   Di organisasi ini saya akhirnya mendapatkan pengalaman yang sangat berkesan apalagi pada saat saya menjalani proses diksar capas, meskipun saya merasakan adanya siksaan fisik dan mental dalam proses diksar ini namun justru hal ini menumbuhkan rasa solidaritas kami sebagai calon paskibra, selain pengalaman diksar saya juga memperoleh pengalaman yang sangat berkesan saat latihan baris-berbaris panasnya matahari bukan menjadi penghalang bagi kami untuk tetap semangat latihan.\r\n- Ekskul Sanggar Seni\r\n   Meskipun waktu saya singkat berada di organisasi ini saya tetap memperoleh pengalaman yang juga tidak akan pernah terlupakan. Di organisasi inilah akhirnya saya menuangkan bakat bernyanyi yang saya miliki, saya sangat senang berada di organisasi ini sebab bakat-bakat seni yang kita miliki dapat kita persembahkan kepada orang lain.\r\n- Ekskul Saintek\r\n   Meskipun keberadaan saya dalam ekskul ini juga tidak lama pengalaman yang saya dapatkan juga tidak akan pernah saya lupakan, di ekskul inilah saya bisa memperdalam ke ingin tahuan saya terhadap bumi, saat bimbingan ekskul kebumian saya selalu semangat dan serius dalam mengikuti pembelajaran.\r\n- Organisasi Remaja Masjid\r\n   Dalam organisasi ini saya mendapatkan pengalaman tentang kepercayaan diri, dalam organisasi ini saya di ajarkan untuk selalu ikhlas dalam berbuat sesuatu dan jangan pernah malu untuk melakukan hal terkhusus kebaikan.',	1,	1654601044,	NULL,	0),
('SCHLR-MYMN-823c25',	'USR-MYMN-09d1bf',	'M Yamin',	'2000-01-25',	'85215878237',	'Kp. Ciwaru III Rt. 009/012 Desa Buniwangi Kec. Surade Kabupaten Sukabumi ',	'Teknik Informatika',	'Universitas Nusa Putra',	'3.62',	'4',	'Saya adalah anak ketiga dari tiga bersaudara, ayah saya seorang petani sedangkan ibu saya adalah ibu rumah tangga. Saya anak yang mempunyai mimpi besar makanya selalu berani mencoba berbagai hal yang tentunya bisa bermanfaat dalam pengembangan diri saya baik itu dari segi softskill dan hardskill. Saya orang yang hobi belajar, kritis, inovatif, tipe pemikir serta memiliki semangat yang besar. Saya juga senang berdiskusi dengan orang-orang yang baru bertukar pikiran dalam hal apapun termasuk bagaimana menyikapi sebuah perbedaan dalam perspektif yang berbeda. Saya orang yang berkemauan besar serta mampu beradaptasi di manapun dengan siapapun orangnya, hal tersebut yang menjadi faktor lebih sehingga orang-orang selalu exsited ketika berdiskusi dengan saya. Kekurangan saya saya sedikit introvert namun ketika dalam forum yang resmi saya cenderung menjadi orang yang paling aktif serta paling kritis.',	'Saya seorang yang memiliki cita-cita yang sangat besar serta ingin berkontribusi besar dalam kemajuan negara ini khususnya dari segi pendidikan dan teknologi. Saya ingin terlibat langsung dalam proses kemajuan negeri ini, tahun 2024 setelah saya lulus studi S1 saya ingin melanjutkan studi ke kota Aachen, Jerman ingin memperoleh beasiswa LPDP. Selain itu saya juga ingin mendirikan startup dalam bidang Youth Empowerment karena saya memiliki minat yang besar dalam pembangunan anak muda khususnya daerah yang masih tertinggal. Salah satu mimpi saya juga adalah ingin mewujudkan program minimal Satu Rumah satu Sarjana dan satu dusun minimal 1 PhD. Saya juga sebelum usia 30 tahun ingin memperoleh gelar internasional dalam bidang keilmuan yang saya miliki serta menyanyikan lagu Indonesia raya dihadapan internasional atas prestasi yang saya raih.\r\n',	'Saya selalu aktif baik itu organisasi, volunteers, kegiatan ataupun perlombaan. Adapun dari pengalaman organisasi saya sampai sekarang aktif di Jurnalis Nuansa yang notabenenya sebagai jurnalis kampus disana saya. berperan sebagai publisher dan juga content creator yang aktif sampai sekarang, saya juga aktif di LDK Ar-Rasyid sebagai bidang kaderisasi, lalu saya juga tergabung dalam Ikatan Alumni Kemah Budaya Kaum Muda Kemendikbud (IA-KBKM), pernah aktif di Indonesia Youth Foundation (IYF) yang berperan sebagai Staff IT, pernah aktif juga sebagai Relawan Muda Peduli Indonesia, saat ini saya juga aktif sebagai Relawan KIP-Kuliah Bidikin mewakili Sukabumi. Selain itu saya juga sebagai Leader Jabar & Banten di Lilin Lilin Desa (LLD Community), pernah aktif di Internship MUN (IMUN), Voice of Internasional Youth for Humanity (VIYH) serta masih banyak lagi pengalaman organisasi dan relawan lainnya.',	1,	1655728080,	NULL,	0),
('SCHLR-NBLLY-d73268',	'USR-NBLLY-7a1c4',	'Nabilla Ayu Dhinniarti Ersal Putri',	'2001-01-10',	'85157579701',	'Jl. UKA XI/10 Surabaya',	'Psikologi ',	'Universitas Negeri Malang',	'3.72',	'4',	'Saya seorang mahasiswi yang sedang menempuh semester 4 jurusan psikologi di Universitas Negeri Malang. Sebagai mahasiswi psikologi tentunya saya perlu mengasah keahlian berbicara saya di depan publik, sehingga saya mengikuti organisasi Ikatan Pecinta Retorika Indonesia (IPRI). Saya merupakan orang yang easy going, mempunyai kemauan untuk berkembang, dan sangat spontan. Saya bisa bekerja dalam sebuah tim dan beberapa kali mengikuti kepanitiaan di organisasi.',	'Mimpi terbesar saya adalah menjadi ibu yang dibanggakan oleh anak saya. Dalam mewujudkan hal tersebut, saya memilih jurusan perkuliahan yang saat ini saya ampu, yaitu psikologi untuk memahami tumbuh dan kembang anak saya. Saya juga belajar berkomunikasi dengan mengikuti organisasi untuk mendapatkan pengalaman dan cara berkomunikasi yang efektif.',	'Ya, saya mempunyai pengalaman organisasi, yaitu Ikatan Pecinta Retorika Indonesia (IPRI) dan Persatuan Radio Kampus Malang (PRKM). Di IPRI, saya menjadi anggota aktif dan telah berperan sebagai announcer di radio kampus selama satu masa periode. Di PRKM, saya menjabat sebagai CO HRD dan telah menyelesaikan semua program kerja dengan baik.',	1,	1654701355,	NULL,	0),
('SCHLR-NBLRT-ea03c4',	'USR-NBLRT-eb59c',	'Nabila Retno Ayu Palupi ',	'2004-01-31',	'81232000859',	'Puger kab.Jember,Jatim.',	'Mipa',	'SMAN 1 Kencong',	'0.00',	'0',	'Saya adalah orang berambisi dalam suatu bidang dan kompetisi. Saya suka hal baru dan menyukai bersosialisasi dan menjaga relasi dengan orang-orang sekitar. Saya memiliki skill dalam berbicara bahasa Inggris dan kemampuan dalam matematika. Saya adalah tipe orang yang akan belajar dengan sungguh-sungguh pada hal yang perlu saya pelajari. ',	'Mimpi terbesar saya tentunya ingin membanggakan orang tua saya dan dapat meraih mimpi saya dimasa depan dengan mendapatkan pekerjaan yang saya inginkan yang bermanfaat untuk semua orang melalui beasiswa ini adalah harapan saya untuk meraih mimpi saya.Karena saya dari keluarga menengah kebawa, beasiswa ini dapat memberikan keringanan dalam menempuh pendidikan saya.',	'Saya termasuk anak yang cukup aktif dalam organisasi maupun kompetisi. Di sekolah saya mengikuti 4 organisasi, yaitu paduan suara,dance,paskib dan english club',	1,	1654136210,	NULL,	0),
('SCHLR-NBLYS-af6aa4',	'USR-NBLYS-3be83',	'Nabila Yasmin Nurrita',	'2002-04-01',	'83179412318',	'JLN. BABAKAN SUKATMA NO.98',	'Seni rupa',	'Institut Teknologi Bandung',	'3.49',	'4',	'Terus bereksplorasi dan menebar manfaat merupakan hal yang diajarkan oleh orang tua. Hasil eksplorasi ini membawa kepada jurusan yang diminati, yaitu seni rupa. Bagi Nabila, seni mampu mewarnai kehidupan banyak orang, memberikan perspektif baru dan imajinasi-imajinasi segar. Nabila sendiri merupakan anak dari tiga bersaudara, kini ia sedang menempuh semester 4 jurusan Seni Rupa di Institut Teknologi Bandung. Kedua orang tua Nabila adalah dosen swasta, ini menjadikan Nabila semakin terpacu untuk menempuh jenjang pendidikan tinggi. Selama berkuliah, Nabila menikmati dan belajar memahami karena banyak pelajaran yang dapat diambil selama berkuliah. Seperti menjadi Ketua Divisi Musik acara angkatan FSRD \'WAVALUNA\' , mengemban tanggung jawab sebagai ketua divisi musik yang sama sekali tidak tahu tentang \'musik\' merupakan risiko besar. Nabila menerima tantangan tersebut dan belajar hal baru, terbukti acara tersebut sukses dan Nabila mampu menguasai dasar musik digital. Tidak hanya persoalan kemampuan, tapi cara berperilaku dan menjadi pemimpin.  Sebagai produser pada animasi \'Tabon\' FFACR 2021 dan \'Journey steps of west Java\', Nabila mencoba untuk merangkul dan meningkatkan potensi kelompoknya. Rasa kekeluargaan dapat tumbuh ketika masing-masing mencoba saling mengenal dan memahami dengan cara seminggu sekali bertemu lewat zoom dan menegur sapa menanyakan kesehatan atau kabar. Sehingga bukan hanya juara 2 pada Festival ANIMAKINI dan juara 1 KKJ Dekranasda JABAR yang diperoleh, tapi esensi dari pertemanan yang saling bertumbuh terasa. Di samping kesibukan lomba, Nabila bekerja sebagai freelance dan menerima pekerjaan desain seperti menggambar karakter vtuber atau desain totebag. Harapannya dengan mengikuti beasiswa YBB Foundation Nabila mampu  ikut meringankan perekonomian keluarga. ',	'Terlibat sebagai konsep artis pada produksi animasi yang menceritakan tentang Indonesia merupakan mimpi terbesar Nabila. Animasi memiliki potensi besar dalam penyebaran informasi di era digital dan menjadi media yang menarik untuk edukasi. Ikut terlibat dalam proses pengerjaannya menjadi impian dan sebuah kebanggaan tersendiri. Maka Nabila mulai mencari pengalaman dengan mengikuti lomba animasi FFACR 2021, Festival Animasi ANIMAKINI 2021, hingga Lomba Film dan Animasi Karya Kreatif Jawa Barat 2022. Mengikuti lomba dapat mengasah kemampuan sebagai konsep artis sekaligus mengenal lebih dalam dunia animasi. Nabila juga mencari lingkungan yang mendukung perkembangannya seperti menjalin  pertemanan dengan pekerja Indonesia di Jepang di bidang animasi, teman-teman kampus yang mendukung proyek animasi, serta keluarga. Selain itu, berusaha meningkatkan kemampuan melalui berlatih menggambar, memperbanyak membaca buku atau artikel, menonton animasi, dan belajar bahasa Inggris. Hal ini dapat membuka sudut pandang baru apalagi ketika Nabila dapat berdiskusi dengan animator atau pekerja seni di luar negeri. Nabila yakin pekerjaan dan mimpinya mampu berdampak bagi banyak orang, oleh karena itu Nabila akan terus berusaha menggapai mimpi. ',	'Selain mengikuti kepanitiaan di kampus, Nabila aktif dalam relawan di luar seperti \'Ekspedisi Merah Putih 2021\' oleh Senyum Anak Nusantara Bandung dan \'Youth Generation Program\'. Kegiatan Ekspedisi Merah Putih (EMP) 2021 merupakan kegiatan relawan dalam rangka memeriahkan dan memperingati kemerdekaan Indonesia dengan mengadakan berbagai perlombaan serta program yang edukatif untuk anak-anak. Nabila bertugas sebagai hubungan masyarakat (Humas) pada kegiatan tersebut. Meninjau langsung lokasi, berkoordinasi dengan pihak masyarakat sekitar, berdiskusi dengan teman panitia lain, dan membantu memeriahkan acara. Menjadi humas memberikan kesempatan untuk dapat berdiskusi dengan warga sekitar yang baru dikenal, mempelajari sopan santun, dan negosiasi. Rasanya lelah tapi terbayarkan ketika melihat raut gembira anak-anak saat kegiatan berlangsung, membuat Nabila merasa mampu memberikan dampak nyata pada sekitar. Lewat perjalanan mengikuti organisasi dan relawan membuat Nabila berusaha merendah diri dan memperhatikan sesama, Nabila bersyukur bisa mengikuti kegiatan organisasi dan relawan. ',	1,	1655731795,	NULL,	0),
('SCHLR-NDHNR-bd6110',	'USR-NDHNR-f45e5',	'Indah Nurazizah',	'2002-05-24',	'85810466858',	'Perumahan pesona bumyagara blok f.11/2 rt/rw. 06/23 kel.kec Mustikajaya',	'Tarbiyah/pendidikan agama Isla',	'universitas Islam 45 Bekasi',	'3.93',	'4',	'saya Indah Nurazizah berumur 20th saya semester 4 di universitas Islam 45 Bekasi atau UNISMA\r\nsaya lumayan aktif di sekolah (mtsn 3 kota Bekasi, man 2 kota Bekasi, unisma) mengikuti kegiatan ekskul, dan acara panitia lainnya\r\nsaya cukup berprestasi saat mts-man terkadang saya mendapat ranking 10 besar pernah juga 20 besar, ipk sementara saya 3.93',	'untuk membahagiakan orang tua saya\r\nsaya ingin cepat lulus agar dapat bekerja apapun itu, tapi saya ingin menjadi guru agar tidak membebani orang tua lagi dan lulus dengan cumlaude',	'mts ekskul marawis\r\nman rohis dan marawis, pernah menjabat sebagai duta sekolah yang disebut Abang none\r\nunisma mengikuti ukm lassq yang berdivisi di bidang urdanus\r\n\r\npernah mengajar sd campuran (3456) karena kebetulan sekolah tersebut blm cukup besar dan murid pun masih sedikit bernama yayasan Baitul Quran Muthmainnah mengajarkan mata pelajaran agama seperti qurdis fiqih ski b arab aqidah, ada pelajaran umum namun blm bgtu fokus ke umum\r\nsaya dibantu partner yg sudah berpengalaman\r\nsaya lumayan dikenal oleh tetangga jadi sosial saya masih dibilamg lumayan',	1,	1653590134,	NULL,	0),
('SCHLR-NDHPR-60f2af',	'USR-NDHPR-df752',	'Indah Permata Sari',	'2003-05-07',	'82131414635',	'Jl. Slamet Riyadi GG 05 No 282 Kanigaran, Jawa Timur, Kota Probolinggo',	'Pertanian-Agroteknologi',	'Universitas Jember',	'3.78',	'2',	'Perkenalkan saya indah permata sari, usia 18 tahun. Saya merupakan mahasiswa aktif di Fakultas Pertanian program studi Agroteknologi, Universitas Jember. Sejak kecil saya memiliki ketertarikan kuat di bidang seni, sehingga beberapa kali diberi kesempatan untuk menjadi delegasi Jawa Timur khususnya Kota Probolinggo dalam perlombaan maupun event lainnya. Sejak tahun 2018-2019 saya juga aktif dalam perlombaan akademik tingkat kota dan tahun 2019 hingga sekarang saya mulai tertarik di bidang pertanian karena melihat kondisi pada saat itu, dimana sektor pangan mulai menurun akibat covid-19.',	'Saya ingin menjadi seorang pengusaha, dari bidang pertanian yang saya minati saat ini akan saya lanjutkan dengan mengelola sebuah lahan sebaik mungkin dengan menghasilkan panen yang maksimal, dimana hasil panen selain dijual juga akan saya gunakan untuk keperluan usaha saya dalam memodifikasi berbagai jenis makanan hingga menjadi kuliner yang menarik perhatian di tahun-tahun berikutnya.',	'Saya saat ini sedang bergabung dengan organisasi UKM PELITA (Penalaran dan Penelitian Mahasiswa Universitas Jember),\r\nSaat ini saya juga sedang bergabung di Tim Eo dalam kegiatan Perlombaan FKTI dan Poster di Universitas Jember,\r\nselain itu saya juga pernah mengikuti kepanitiaan dalam acara makrab dan webinar kegiatan Pasca Periskop di Fakultas Pertanian Universitas Jember',	1,	1653978851,	NULL,	0),
('SCHLR-NDHSH-385164',	'USR-NDHSH-83858',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1653810767,	NULL,	0),
('SCHLR-NDHSH-c1048c',	'USR-NDHSH-83858',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1653810766,	NULL,	0),
('SCHLR-NDHSH-fa8311',	'USR-NDHSH-83858',	'Nadiah Sahidah Ulya',	'2002-08-14',	'81316415591',	'Apron 8D/502 RT 008/RW 010 Kelurahan Kebon Kosong, Kemayoran, Jakarta Pusat',	'Ilmu Komputer',	'Institut Pertanian Bogor',	'2.99',	'4',	'Saya mengenal diri saya sebagai seorang yang serius, tanggung jawab, dan teguh pendirian terhadap prinsip yang saya pegang. Saya tipe orang yang terstruktur, sangat penuh perhitungan dan perencana. Saya selalu menjalani sesuatu tanpa pertimbangan atau langkah-langkah yang akan saya jalani. Saya juga tipe pembelajar yang ingin belajar mengenai hal baru, terutama untuk melatih indera dan empati saya terhadap lingkungan.',	'Saya ingin menjadi seseorang yang bermanfaat bagi orang banyak. Suatu saat saya ingin memunculkan inovasi-inovasi untuk pembelajaran bidang teknologi bagi anak muda terutama yang memiliki kekurangan dan tidak bisa sekolah dan tidak tercapai oleh perhatian pemerintah. Mungkin, suatu saat apabila saya merasa cukup ilmu saya ingin mencoba membuat tim social project seperti itu agar pendidikan di Indonesia bisa merata. Saya juga berkeinginan menjadi seorang Data Scientist atau Data Analyst, cara mewujudkannya tentu saja dengan belajar dan mendalami bidang tersebut dengan giat atau mengikuti course pada platform-platform belajar.',	'Saya pernah mengikuti ogranisasi IKADA (Ikatan Mahasiswa Darma Ayu) sebagai bendahara dan menjadi bagian dari panitia program kerja sebagai relawan ke pelosok untuk memberikan bantuan pendidikan mengingat kondisi mereka yang masih jauh tertinggal. Saat ini saya juga aktif di Asrama Kepemimpinan IPB, Konselor Sebaya IPB dan beberapa kepanitiaan lainnya.',	1,	1653811455,	NULL,	0),
('SCHLR-NDLRZ-63b050',	'USR-NDLRZ-813fd',	'Nadila Rizky Amelia',	'2001-05-11',	'895606181314',	'Jl. Dr. Moh. Hatta, Cupak Tangah, Kec. Pauh, Kota Padang, Sumatera Barat 25176',	'Sistem Informasi ',	'Universitas Andalas',	'3.87',	'2',	'Gigih, visioner, dan ambisius adalah 3 kata yang mengggambarkan mengapa saya layak menjadi awardee Beasiswa Pemuda by Youth Break The Boundaries. Saya adalah anak rantau dari Bali yang memberanikan diri untuk kuliah di Padang. Awalnya saya gagal lolos KIP Kuliah, saya masuk UNAND jalur mandiri. Karena keinginan kuliah saya sangat besar, saya memberanikan diri untuk nekat berangkat sendiri dari Bali ke Padang (pertama kalinya naik pesawat) agar bisa mengikuti perkuliahan tatap muka di kampus (situasinya, saya belum membayar administrasi kampus dari semester 1 - semester 2, hanya bermodalkan niat \r\nserius untuk berkuliah dan proposal ide startup yang sudah saya dan tim ikuti sebelumnya di 1000 Startup Digital). Ketika sampai di kampus untuk pertama kalinya, saya langsung menghadap ke Dosen PA, Ketua Jurusan, Wakil Dekan III, hingga Wakil Dekan II untuk menceritakan kendala keuangan saya dan proposal startup yang saya dan tim miliki (saya presentasi bahwa saya punya ide startup, saya ingin berprestasi untuk kampus, saya juga ingin memberikan sesuatu untuk kampus, namun saya masih proses belajar, dan melalui proposal ini saya ingin membuktikan minimal niat keseriusan saya untuk berkuliah dan berprestasi (ketika presentasi saya jelaskan step by step yang akan saya dan tim kami eksekusi). Akhirnya saya diizinkan untuk tetap berkuliah dengan saran untuk mencoba \r\nkesempatan beasiswa-beasiswa yang ada (Itu pasti dan saya pun memulai perburuan beasiswa). Saya coba Beasiswa Permata (Gagal), Beasiswa VDMI (Gagal), PKM Nasional (Gagal), Business Plan Compertition (juga Gagal). Karena saya takut tidak bisa membayar kuliah, saya coba cari magang/kerja agar bisa meminjam uang dan menyicil dari hasil gaji yang saya dapatkan. Saya perbaiki Linkedin, saya perbarui CV. Setelah saya tebar portofolio dan CV di linkedin maupun di email, saya hanya berhasil mendapatkan magang yang non-paid namun dengan posisi kerja yang bagus, sebagai Data Analyst. Orang tua saya juga berharap-harap cemas tentang kondisi saya di kampus. Beliau sedih tidak bisa \r\nmembantu biaya perkuliahan saya karena sedang terdampak covid-19. Saya hanya bisa meyakinkan kalau saya akan terus mencoba peluang-peluang yang ada, selagi ada kesempatan akan saya coba seterusnya. Jika ditanya, “apakah kamu senang kuliah di UNAND?”, iya saya sangat senang, saya sangat antusias dengan lingkungan belajarnya, saya sangat senang dengan teman-teman yang open minded, saya sangat suka dengan dosen dan pihak kampus yang supportif, dan saya sangat menikmati dengan lingkungan atau kegiatan kampus yang meningkatkan kemampuan softskill maupun hardskill saya pribadi. Saat ini, semester 2 akan berakhir dan saya masih belum bisa menemukan jalan keluar \r\nuntuk kendala biaya kuliah saya. Akhir Mei kemarin, saya pun menemui Bapak Dekan untuk menyampaikan kegagalan saya dalam mencari beasiswa dan usaha apa saja yang telah saya lakukan untuk tetap bisa berkuliah di UNAND (ini adalah salah satu dokumen yang saya presentasikan dihadapan Bapak Dekan https://bit.ly/profilnadila). Beliau memutuskan bahwa kampus akan menalang sementara biaya kuliah saya agar saya bisa mengikuti ujian akhir (jadi saya tetap harus membayar) dan Beliau juga menyemangati saya untuk teruslah berusaha dalam mencari beasiswa, memenangkan kompetisi, dan meningkatkan skill untuk gabung di project-project kampus atau berprestasi demi nama baik kampus, fakultas, maupun nama baik jurusan. Insya Allah saya akan terus berusaha dan bersemangat demi harapan keluarga dan harapan kampus yang dititipkan kepada saya.',	'Saya ingin mengembangkan lebih besar startup DISKAS yang saya rintis bersama tim saya. Saat ini saya berperan sebagai Founder dan CEO dari Diskas. Diskas adalah platform konsultasi dari mahasiswa berpengalaman baik dibidang akademik maupun non akademik secara instan dan terpercaya. Sebagai contoh, jika semisal saat ini saya adalah awardee Beasiswa Pemuda,maka saya bisa menjadi mentor di Diskas dan membagikan kisah pengalaman serta tips dan trik bagaimana caranya saya bisa berhasil lolos sebagai awardee Beasiswa Pemuda. Namun DISKAS tidak hanya terpaku pada bidang beasiswa saja. Apapun prestasi yang dimiliki oleh mahasiswa, asalkan bisa dibuktikan dengan sertifikat, foto, video, portofolio maupun bentuk lainnya setiap mahasiswa memiliki kesempatan yang besar untuk join sebagai mentor DISKAS. Selama menjalankan DISKAS, beberapa kegiatan telah kami ikuti untuk pengembangan DISKAS yang lebih baik seperti mengikuti tahapan bootcamp 1000 Startup Digital Pekanbaru pada Nov 2021. Mulai coba terjun market pada Feb 2022, berkolaborasi dengan pihak kampus seperti Dosen dan BEM untuk memasarkan DISKAS lebih dekat ke mahasiswa. Sampai saat ini, sudah terdapat >5 mentor dan lebih dari >20 mentee tergabung di dalam DISKAS. Rencana kami selanjutnya adalah kami ingin mengembangkan website agar tampilan mentor kami lebih tertata rapi dibandingkan instagram selain itu agar transaksi juga cukup terjadi melalui website saja dan selain itu, kami juga ingin mengikuti beberapa kompetisi atau funding agar bisnis model kami dapat dipercaya oleh banyak kalangan',	'Pada September 2021 saya pernah menjadi anggota Divisi Programming di Organisasi tingkat kampus yaitu Neotelemetri. Disini saya mempelajari terkait dasar-dasar pemograman python dan machine learning. Pada November 2021, saya pernah menjabat sebagai Wakil Ketua Panitia dalam acara kepanitiaan tingkat fakultas yaitu FTI’21 Nusantara. Disini saya bertanggungjawab untuk membantu ketua menyukseskan acara keakraban antara mahasiswa baru Angkatan 21 dengan kakak tingkatnya dengan jumlah peserta yang berhasil kami kumpulkan >250 peserta seluruh Fakultas Teknologi Informasi. Pada Desember 2021 hingga sekarang saya menjabat sebagai Content Management di salah satu startup bidang literasi digital yaitu Poddium. Disini saya bertanggungjawab untuk menginputkan buku klasik ataupun buku baru ke dalam aplikasinya (5 buku perminggu) dan membuat cover ebook disetiap buku yang akan diinputkan. Pada Februari 2022 sampai sekarang saya tergabung sebagai Volunteer Graphic Designer di Beasiswa 10.000. Disini saya bertanggungjawab untuk membantu beberapa konten Instagram sesuai dengan jadwal yang telah ditentukan (2 konten/minggu). Pada bulan yang sama yaitu Februari 2022 sampai sekarang, saya juga tergabung sebagai intern di Laboratory Business Intellegent Universitas Andalas. Disini saya mendapatkan beberapa tugas atau projek dibidang pengolahan atau visualisasi data (1 minggu=1 tugas). Pada bulan April 2022 sampai sekarang saya juga tergabung sebagai Data Analyst Intern di Dialect.Act. Disini saya bertugas untuk mengolah data yang berasal dari divisi People Acquisition atau data customer di Dialect.Act.  Pada bulan Mei 2022 sampai sekarang saya juga berperan sebagai Surveyor Tracer Study UNAND di UPT Career UNAND yang bertugas melacak penyebaran alumni UNAND (160 data/bulan). Pada bulan Juni 2022, saya juga berperan sebagai Intern Divisi Programming di Andalas Flying Robot Generation. Disini saya mengikuti kegiatan pelatihan electrical dan programming sebanyak 6 kali per dua minggu.',	1,	1655665923,	NULL,	0),
('SCHLR-NDMYR-03dcac',	'USR-NDMYR-8f8ab',	'Enda Maya rosalia',	'2003-03-30',	'87863227360',	'Pringgarata lombok tengah,NTB',	'Bahasa ',	'SMA MODEL NURUL JANNAH',	'8.8',	'0',	'Saya Terlahir dikeluarga Yang Keterbatasan akan Ekonomi, Bersyukurnya saya bisa Melanjutkan sekolah sampe Slese SMA Dengan kondisi ekonomi yang seperti itu, Alhamdulilah Berkat dukungan guru2 Dan doa ibu,saya Tidak mau Berhenti sampe SMA saja,Saya Ingin melanjutkan study ke jenjang yang lebih tinggi lagi,Agar bisa Meyakinkan seseorang bahwa Keterbatasan ekonomi bukanlah Jadi penghalang untuk mendapatkan masa depan yang Indah,Mariii menciptakan perubahan',	'Saya ingin jadi Dosen,Agar saya Bisa Berbagi ilmu kepada semua orang,Karna percuma jika saya sekolah tinggi Tapi tidak bisa mengamalkan ilmu yang telan saya pelajari,,Cara saya Mewujudkannya adalah dengan Study hard pray hard be the best,Because Nothing is impossible with allah',	'Saya Pernah mengikuti kegiatan ke pramukaan dan Tahfidz, Didalam pramuka Saya mendapatkan banyak pelajaran Tentang arti perjuangan, kebersamaan, kekeluargaan dan solidaritas yang Tinggi.',	1,	1654172955,	NULL,	0),
('SCHLR-NDNGS-88f965',	'USR-NDNGS-711e3',	'Nadia Angie sihotang',	'2007-01-09',	'88262683001',	'Provinsi Sumatera Utara',	'Jurusan IPS',	'SMA Swasta Santo Mikhael Pangu',	'8.91',	'2',	'Saya adalah seorang anak sma kelas 10 jurusan IPS berumur 15 tahun. Saya memiliki skill berupa menyanyi dan menari. Saya juga sering ikut perlombaan perlombaan yang berhubungan dengan skill saya, serta belajar hal baru. Alasan utama saya mengikuti sebuah program beasiswa adalah untuk meringankan biaya sekolah saya tentunya sekaligus membantu supaya saya bisa tetap mencari ilmu dibidang yang saya inginkan.\r\nPENDIDIKAN\r\nSMAS SANTO MIKHAEL PANGURURAN – Kabupaten samosir Negara Indonesia	\r\nJurusan IPS	\r\nPRESTASI*\r\n1)Meraih piagam penghargaan khusus sebagai JUARA 7 olimpiade Sosiologi Tingkat SMA/MA/SMK Sederajat	\r\nPenyelenggara ketua club olimpiade dan didukung Fakultas MIPA USU\r\n2)Mendapat piagam penghargaan LOMBA VOCAL SOLO sebagai JUARA 3 Dalam rangka peringatan HUT RI ke-76  tahun 2021\r\nKepala SMAS St. Mikhael Pangururan	\r\n                                                                                                                           \r\n3)Mendapat piagam penghargaan sebagai JUARA  3 semester ganjil kelas \r\n10 IPS UNGGULAN\r\nYayasan perguruan katolik Santo Yoseph Medan di Siantar\r\n4)Peraih Medali EMAS dalam kompetisi IIC 2022                                             \r\nKetua pelaksana IIC 2022 [Indonesia Intelligent Competition]',	'\"SUKSES\" setiap orang memiliki definisi suksesnya sendiri-sendiri. Sukses menurut saya adalah sesuatu yang bisa saya lakukan dan itu bisa berguna untuk orang lain walaupun orang lain itu orang terdekat kita.Dulu sewaktu saya SD masuk 10 besar saja saya sudah sangat bangga dan setelah SMP kelas dua disitu saya pertma kali juara dan setelah masuk SMA selalu juara hingga akhir semster ini saya juara umum dibidang IPS kelas 10.Saya selalu bermimpi kelak jika saya lulus nanti  kuliah dan telah bekerja, sebagian gaji akan saya tabung. Jika sudah terkumpul saya ingin mendirikan sekolahan gratis untuk anak-anak tidak mampu. Dan juga saya ingin mendirikan sebuah kos-kosan. Lumayan untuk menambah pemasukan. Saya juga ingin membahagiakan kedua orangtua dengan hasil kerja keras saya. Mungkin inilah kesuksesan terbesar dalam hidupku.Mulai dari sekarang saya akan terus berusaha agar semua mimpi-mimpi saya dapat tercapai dan terlaksana. Dan akan lebih baik lagi jika kelak banyak yang bisa saya lakukan untuk dapat membuat bangga dan berguna untuk banyak orang. Maka dari itu kesuksesan itu bukan dicari tetapi kita yang ciptakan sendiri.\r\n\r\n\r\n\r\n\r\n\r\n',	'FORUM ANAK DESA TURPUK SIHOTANG KAB SAMOSIR \r\nSebagai KETUA\r\nPEMUDA PEMUDI REMAJA GKPI HARIAN\r\nBOHO KAB SAMOSIR\r\nSebagai Bendahara\r\nPRAMUKA SMAS ST.MIKHAEL PANGURURAN\r\nSebagai Anggota \r\nSANGGAR TARI SMAS ST.MIKHAEL PANGURURAN\r\nSebagai Anggota\r\nSaya juga termasuk orang yang sangat suka mencoba hal baru terkususnya dalam hal keorganisasian karena dari situ kita dapat mengasah kemampuan bersosialisasi kita,mengenali bakat kita seperti masa muda remaja sekarang yaitu mencari jati diri dan untuk menambah relasi serta wawasan',	1,	1655743617,	NULL,	0),
('SCHLR-NDNRH-0de6b0',	'USR-NDNRH-6b294',	'Nadia Nur Habibah',	'2003-03-27',	'85722834654',	'Jl. Manirancan rt02/14 Desa Majasetra, Kecamatan Majalaya, Kab. Bandung Jawa Barat (40392)',	'Akuntansi Sektor Publik',	'Universitas Padjadjaran',	'3.44',	'4',	'   Saya merupakan seorang pelajar asal kab.Bandung, Jawa Barat yang sekarang sedang menempuh pendidikan di program studi Akuntansi Sektor Publik di Fakultas Ekonomi dan Bisnis Universitas Padjajaran angkatan 2020. Saya diterima di Unpad melalui jalur mandiri Kartu Indonesia Pintar (KIP)-kuliah. Selang 1 bulan dari waktu Saya dinyatakan lulus di FEB Unpad, Saya bekerja di sebuah grosir plastik sebagai kasir untuk membantu menambah penghasilan saya selama kuliah.\r\n\r\n   Selama perkuliahan saya juga mengikuti berbagai organisasi kampus untuk menambah ilmu, relasi dan semangat baru di tengah padatnya kuliah. Dan Alhamdulillah saya dipertemukan dengan teman-teman yang ambisius di bidang pendidikan hingga akhirnya saya berhasil menjadi delegasi Instanbul Youth Leader Summit yang diselenggarakan pada bulan maret lalu.\r\n\r\n   Selama berkuliah, Saya merasa dapat mengombinasikan antara kemampuan dan passion saya pada kegiatan sosial, dalam hal ini adalah penggunaan Akuntansi pada organisasi/kepanitiaan dengan pemahaman ilmu sektor publik yang Saya miliki. \r\n\r\nSelain menyukai hal yang berkenaan dengan kegiatan sosial saya juga sangat tertarik dengan isu-isu lain, seperti edukasi, ekonomi, lingkungan, hubungan internasional dan minoritas. dimana dengan berbekal ketertarikan dalam berbagai isu tersebut,Saya merasa lebih mampu memahami berbagai situasi yang ada, baik dalam konteks pembelajaran, maupun dalam konteks bersosialisasi.',	'   Berdasarkan hasil sensus penduduk 2020 Terhadap Kebijakan Pembangunan Kependudukan mayoritas penduduk Indonesia atau sebesar 65% nya hanya tamatan SMP/Sederajat. Dan itu saya rasakan di daerah saya sendiri dimana pendidikan merupakan suatu hal yang masih dianggap tabu dan dirumorkan dengan biaya yang fantastis dimana akhirnya sebagian besar orang tua menawarkan anak-anak mereka bahkan saat masih dibawah umur, untuk langsung bekerja dan meragukan anaknya untuk melanjutkan jenjang pendidikan.\r\n\r\n   Maka dari itu, saya merasa sangat prihatin dan ingin pendidikan di Indonesia merata, bukan hanya dari kebijakan pemerintahnya tapi kita juga memerlukan adanya forum diskusi dan sosialisasi bagi masyarakatnya sendiri agar memiliki kesepakatan yang sama akan pentingnya pendidikan.\r\n\r\n   Oleh karena itu ,dalam perjalanannya saya memprioritaskan pendidikan tetapi juga aktif mencari peluang akan beasiswa, bekerja, juga terlibat dalam organisasi/ kepanitiaan dan kegiatan sosial lainnya dengan tujuan mematahkan stigma pendidikan itu mahal dan membuang waktu, serta meyakinkan masyarakat bahwa pendidikan di zaman 4.0 ini dapat kita peroleh dengan mudah melalui banyak pihak dengan memanfaatkan teknologi dan informasi.',	'   Salah satu pengalaman saya yang berharga adalah dimana ketika bulan November lalu saya terlibat kepanitiaan Padjadjaran Education Festival dan mendapatkan kesempatan untuk mengunjungi beberapa sekolah di kab. Bandung dan mensosialisasikan banyak hal mengenai kampus.       \r\n    \r\n  Dimana pada saat itu saya bertemu banyak sekali siswa SMA yang pada awalnya ragu untuk melanjutkan pendidikan lalu akhirnya beberapa dari mereka menceritakan alasan dibaliknya kepada saya sehingga akhirnya berlanjut dengan melakukan beberapa kali diskusi dan konsultasi via sosial media.\r\n\r\n   Hingga akhirnya beberapa dari mereka mencoba kesempatan untuk mendaftarkan diri berkuliah dan saya banyak mendapatkan kabar baik dari  teman-teman SMA yang telah berkonsultasi Alhamdulillah telah diterima di universitas impian dengan beberapa dibantu beasiswa.',	1,	1654232745,	NULL,	0),
('SCHLR-NDNRM-7591d9',	'USR-NDNRM-2d5cd',	'Nadia Nur mazidah',	'2000-03-22',	'85783471033',	'Ds.Jogodalu RT.09/ RW.02 Kec.Benjeng - Kab.Gresik, Jawa Timur',	'Bahasa dan sastra arab   Human',	'UIN Maulana Malik Ibrahim Mala',	'3.45',	'2',	'Nama saya Nadia Nur Mazidah biasa dipanggil Nadia, asal dari gresik . Sekarang sebagai mahasiswi semester 2 di UIN Maulana Malik Ibrahim Malang, jurusan Bahasa dan Sastra Arab. Sebagai luluan pesantren membuat saya suka dengan bahasa Arab. Sehingga menjadikan saya untuk memilih jurusan ini. Saya suka dengan kebahasaan baik bahasa asing lainnya, tetapi bahasa arab adalah bahasa kesukaan saya .',	'Mimpi terbesar saya adalah bisa sekolah setinggi-tingginya dan   ingin menjadi orang sukses dan  sehingga bisa membantu saudara2 kita khususnya di indonesia yang perlu perhatian dari kalangan muda. Dan cara mewujudkannya adalah dengan belajar yang rajin agar bisa mengejar cita2 yang diimpikan juga salah satunya dengan mengikuti beasiswaini semoga bisa membantu pendidikan saya.',	'organisasi OPPM (Organisasi Pelajar Pondok Modern) ',	1,	1655734677,	NULL,	0),
('SCHLR-NDRHM-163d40',	'USR-NDRHM-b580d',	'Andi rahma muawiyah',	'2003-06-16',	'85809142950',	'Jakarta pusat',	'Ilmu hukum',	'Universitas lampung',	'3.89',	'2',	'Saya adalah seseorang yang sangat bersemangat akan hal baru',	'Mimpi terbesarku adalah padai dalan berkomunikasi untuk mewujudkannya perlu melatih komunikasi dari setiap hari',	'Saya mempunyai pengalaman organisasi dikampus dimana saya adalah salah satu staff kadersiasi yang dimana tugas kita untuk merangkul teman-teman dan itu benar benar pekerjaan yang sangat keren!',	1,	1655485502,	NULL,	0),
('SCHLR-NDSYL-5667a6',	'USR-NDSYL-d4cbe',	'Nada Sylvina Sheila Shabrina',	'2004-01-25',	'85875076757',	'Karangbendo RT 06 RW 01, Kelurahan Karangrejo, Kecamatan Gajahmungkur, Kota Semarang, Jawa Tengah',	'Statistika/Fakultas Sains dan ',	'Universitas Diponegoro',	'9.37',	'0',	'Saya seorang mahasiswa baru yang berhasil menembus jalur SNMPTN untuk sampai pada salah satu universitas terbaik di Indonesia, Universitas Diponegoro, program studi Statistika. Keberanian bermimpi meyadarkan saya yang lahir dari keluarga jawa sederhana, bahwa dimulai dari satu langkah kecil hal hebat akan terjadi. Menjadi anak perempuan pertama dari tiga bersaudara semakin menguatkan rasa tanggung jawab saya untuk terus maju dan membuka gerbang besar bagi kedua adik perempuan saya. Waktu yang tidak pernah lelah melaju menarik saya untuk ikut terpacu menegaskan bahwa tidak ada yang tidak mungkin untuk terus diperjuangkan. Banyak pengalaman gagal yang berhasil saya lewati. Ya, saya menyebutnya berhasil, karena saya mendapatkan satu pondasi baru untuk menopang langkah saya selanjutnya. ',	'Mendirikan perusahaan jasa asuransi adalah mimpi terbesar saya. Saya merasa dapat mendukung banyak orang secara tidak langsung. Langkah yang panjang sangat diperlukan untuk sampai pada mimpi besar ini. Dimulai dari terus belajar dan mengambil setiap kesempatan untuk mencoba dan mencari pengalaman gagal juga berhasil. Salah satu langkah saya adalah mengikuti program beasiswa YBB. Dari sini saya akan bertemu hal baru, dan karakter-karakter baru yang ada dalam jangkauan teknologi hebat ini. Pengalaman baru tentu saja akan memberikan tambahan pondasi bagi saya untuk terus bermimpi.',	'Saat duduk di bangku sekolah menengah pertama, saya termasuk dalam anggota organisasi kepramukaan Dewan Galang, SMP Negeri 2 Semarang. Dalam organisasi tersebut saya berkedudukan sebagai Ketua Regu Putri. Kegiatan perkemaahan, latihan rutin, hingga beragam perlombaan telah saya ikuti selama bergabung dalam organisasi ini. Melalui organisasi ini saya belajar untuk menerima kekalahan menjadi pelajaran, kerjasama, menumbuhkan jiwa kekeluargaan, dan hal sosial lain yang sangat membantu saya dalam kehidupan pribadi.',	1,	1655694972,	NULL,	0),
('SCHLR-NDVNC-95a3ce',	'USR-NDVNC-7561e',	'Nadia Vincy',	'2004-03-05',	'8152029113',	'Jalan YC OEVANG OERAY Kecamatan Sintang Kabupaten Sintang Kalimantan Barat',	'MIPA',	'SMA Negeri 03 Sintang',	'3.23',	'6',	'Perkenalkan nama saya  saya Nadia Vincy tinggal di kota Sintang, lahir pada tanggal 05 Maret 2004. saya sekolah di SMA dengan jurusan IPA dengan nilai akademik yang baik dimana saya memiliki cita-cita kuliah di fakultas MIPA prodi Biologi.\r\n\r\nSelama saya SMA saya sudah mengikuti beberapa olimpiade Biologi serta mengikuti beberapa lomba diluar sekolah seperti lomba membuat poster, lomba membuat cerpen ataupun karya tulis ilmiah dan lain-lain.\r\n\r\nSaya anak ke 3 dari 4 bersaudara dimana kondisi ekonomi cukup berat  karena, biaya sekolah dan biaya hidup sehari-hari. Oleh karena itu untuk meringankan orang tua saya berharap dapat memperoleh beasiswa ini.\r\nSelain masalah keuangan menjadi dorongan kuat untuk mendapatkan beasiswa ini, akan tetapi saya memiliki minat bakat yang saya yakini mampu untuk kuliah dengan baik serta dapat lulus menjadi sarjana yang memiliki spesifik keahlian dalam bidang biologi.\r\n\r\nHarapannya saya dapat meringankan orang tua dalam hal biaya kuliah dan menjadi kebangaan orang tua.',	'Mimpi terbesar saya yaitu menjadi seorang biopreneur yang membuka banyak bidang usaha berbasis ramah lingkungan baik kebutuhan penting ataupun kebutuhan sehari-hari.\r\n\r\nCara mewujudkannya yaitu dimulai dengan mengikuti berbagai kegiatan diluar sekolah sejak saya masih SMA, salah satunya kegiatan mengolah sampah menjadi produk jadi. Saya juga ingin mengambil prodi biologi fakultas MIPA ketika kuliah. Saya berencana untuk mengikuti program pertukaran pelajar yang bertujuan untuk memperluas wawasan dan ilmu serta pengetahuan tentang produk ramah lingkungan yang sudah banyak diproduksi diluar negeri. Setelah itu, setelah lulus kuliah saya mencari pekerjaan terlebih dahulu untuk mendapatkan modal. Setelah modal terkumpul, saya akan memproduksi produk ramah lingkungan dalam skala kecil terlebih dahulu. Mengenai detail dari produk ini, saya harapkan bisa lebih dipelajari lebih dalam ketika saya berkuliah.',	'Saya pernah mengikuti beberapa kegiatan organisasi dan relawan, salah satu kegiatan organisasi yang pernah saya ikuti yaitu OSIS, Kepramukaan dan Organisasi Peduli Hutan Kalimantan.\r\nSelain itu pengalaman menjadi relawan yang pernah saya ikuti yaitu kegiatan Penghijauan dan reboisasi hutan Kalimantan, Kegiatan Pembersihan Lingkungan di area sekitar Kota Sintang, dan kegiatan pembagian sembako dan obat-obatan bagi masyarakat terdampak banjir tahun 2021.',	1,	1655729858,	NULL,	0),
('SCHLR-NFFTR-a1583b',	'USR-NFFTR-209bd',	'Anafa Fitra Marizka',	'2000-12-18',	'81279209989',	'RT:008 RW:021 Gg.Cempaka II, Jl. Ta\'ib, Dul, Pangkalan Baru, Bangka Tengah, Bangka Belitung',	'Pendidikan Bahasa Inggris Faku',	'Universitas Negeri Yogyakarta',	'3.30',	'6',	'Saya adalah mahasiswa pendidikan bahasa Inggris di Universitas Negeri Yogyakarta. Berbicara mengenai diri sendiri, saat ini saya mengibaratkan diri saya sebagai kuda eskula/unicorn yang berarti makhluk yang memiliki karakter kemurnian, keberanian dan kekuatan. Ketiga karakter tersebut menjadi pedoman hidup saya untuk mengembangkan diri menjadi pribadi yang suka menolong dan aktif mencoba hal baru tanpa keraguan karena saya mampu menangani ketakutan saya dengan pemahaman dan pengalaman saya. Pengalaman saya dalam bidang sosial adalah menjadi partnership di acara nasional dan internasional, dan memimpin sebuah project di organisasi Sebersy dan Dignity Social. Berdasarkan pengalaman dan kemampuan yang saya miliki saat ini adalah sebuah proses yang membentuk diri saya hingga saat ini dalam meraih masa depan.',	'Mimpi saya di masa depan adalah menjadi project leader dibidang multilateral dan pendidikan di Bangka Belitung. Untuk mewujudkan impian tersebut saya lakukan dengan memaksakan diri keluar dari zona nyaman, memulai, aksi, mengevaluasi setiap proses yang saya lakukan, menginvestasi ilmu pada diri saya, dan berkonsultasi kepada orang yang berprofesional dalam bidang yang saya geluti. \r\nSaya memulai aksi dengan keluar dari zona nyaman dengan bergabung di sebuah organisasi sosial yang membuat saya belajar beradaptasi dan bersosialisasi. Saya juga memaksakan diri saya bertanggung jawab disetiap jobdesk yang diberikan kepada saya. Tidak hanya itu, saya juga melakukan evaluasi di setiap kesalahan yang saya lakukan dan membuat strategi agar kesalahan saya bisa diminimalisir. Contohnya, ketika saya memimpin disebuah kegiatan dan pembicara di kegiatan tersebut tidak bisa menghadiri jadwal tersebut, maka saya akan mengkomunikasikan kegiatan tersebut secara personal agar bisa mendapatkan solusi, dan berkoordinasi dengan tim saya mengenai manajemen jadwal kegiatan dan publikasi kegiatan tersebut.  Evaluasi ini berhasil saya terapkan dalam kehidupan sehari-hari dan membawa dampak positif. \r\nDari mengikuti organisasi sosial saya mendapatkan berbagai manfaat yang yang saya investasikan kepada diri saya antara lain kemampuan partnership, kemampuan komunikasi, kemampuan public speaking dan kemampuan project management yang saya yakin akan mendukung pencapaian mimpi saya. Saya juga berkonsultasi kepada orang yang profesional dalam kemampuan tersebut. Tidak hanya manfaat kepada diri saya, tetapi kegiatan yang saya ikuti berdampak kepada masyarakat di bidang pendidikan salah satunya kegiatan menuju kampus impian di Gapai Mimpi terhadap siswa kelas 12 SMA di Bangka Belitung yang berhasil diselenggarakan dan mendapatkan respon positif dari orang tua dan siswa. Hal itu membantu siswa melanjutkan kampus impian mereka masing-masing. \r\nAkhirnya saya sangat bersyukur karena hal-hal tersebut sangat membantu saya untuk mewujudkan impian saya di masa depan.  \r\n',	'Saya memiliki pengalaman dalam melibatkan diri di Sebersy Organization untuk menghubungkan mitra eksternal dan melibatkan mereka untuk mencapai tujuan antara dua pihak dan membuat proyek tentang pemahaman budaya global di IG Live dan budaya lokal. Proyek ini juga membawa dampak positif pada kesadaran budaya, di bagian komunikasi antar budaya, dan menciptakan kesatuan yang baik dalam budaya pemahaman yang akan membawa pembangunan berkelanjutan. Selain itu, saya juga memiliki pengalaman di Rumah Milenial Regional Yogyakarta sebagai Koordinator Humas dan Kemitraan. Dalam peran ini, saya belajar memahami dunia kehumasan yang sampai saat ini menjadi penghubung yang baik sesuai tujuan dan menjaga kemampuan komunikasi saya antara pihak luar dan dalam lingkungan organisasi. Program kehumasan yang saya lakukan adalah acara online di webinar dan IG Live yang kami selenggarakan setiap 2 minggu sekali dengan berbagai ide tema untuk anak muda di daerah regional Yogyakarta dan nasional. \r\n',	1,	1654914045,	NULL,	0),
('SCHLR-NFND-43d8af',	'USR-NFND-67f5a0',	'anifa nadia',	'2004-07-31',	'8153849294',	'komp.Griya Senang Hati, Maskarebet Raya',	'IPS',	'Sma Negeri 22 Palembang ',	'3.98',	'2',	'Saya adalah seorang yang ajtif dalam berbicars, syaa mampu bekerja sama dalam tim, dan saya suka mencoba hal baru, saya seringkali mengulur waktu dalam mengerjakan sesuatu, namun saya memperbaiki kebiasaan buruk saya dengan lebih menghargai waktu dan juga lebih efisien dalam pekerjaan ataupun aktivitas.',	'saya memiliki mimpi untuk menjadi seseorang yang sukses dan bisa membanggakan orang terdekat saya, saya yakin memang tidak mudah namun saya berusaha untuk mewujudkannya, dimulai dari hal kecil, hinggak terus memperbaiki diri, mempelajari hal baru sehingga saya bisa mejadi kan diri saya lebih baik lagi dan terus berkembang untuk mewujudkan mimpi saya.',	'ya, saya memiliki pengalaman organisasi di bidang masyarakat, syaa pernah bergabung di salah satu organisasi pusat informasi konseling remaja, dan juga genre sumsel, saya juga berperan aktif dalam bidang divisi humas maupun medinfo dalan berorganisasi, terkadang saya memberikan seminar dan mengikuti seminar masyarakat untuk menambah wawasan dan pengalaman pribadi saya.',	1,	1653924610,	NULL,	0),
('SCHLR-NFTRS-bdb913',	'USR-NFTRS-39d0b',	'Nofita Restu Awaliani',	'2001-11-21',	'82137361517',	'Desa Cilangkap RT 05/04, Kec. Gumelar, Kab. Banyumas',	'Fakultas Teknik Jurusan Teknik',	'Universitas Jenderal Soedirman',	'3.33',	'4',	'Saya adalah mahasiswa semester 4 yang sedang menempu Pendidikan S1 jurusan Teknik Sipil di Universitas Jenderal Soedirman. Saat ini saya berkuliah jauh dari rumah sehingga harus menyewa tempat tinggal atau ngekos. Saya mengeksplore lebih jauh mengenai ketertarikan saya dibidang kewirausahaan dengan cara berdagang online. Tidak hanya tertarik akan berwirausaha saya juga tertarik pada kerajinan tangan, sehingga di online shop saya berjualan pernak Pernik tentang kerajinan tangan. Dalam perkuliahan kewirausahaan saya terapkan pada kegiatan organisasi yang membutuhkan dana dari luar fakultas maupun jurusan. Dari hasil berwirausaha saya dapat menambah uang jajan serta menabung sedikit demi  sedikit. Harapan saya kedepannya agar bisa menyisihkan uang untuk membantu orang tua dalam membayar uang kuliah. ',	'Mimpi terbesar saya adalah bisa menjadi manusia yang berguna bagi manusia lainnya. Saat ini saya telah perlahan mendekati mimpi saya dengan membantu orang orang disekitar dengan semampu saya. Harapannya kebiasan membantu orang lain ini dapat terus berlanjut sampai di masa depan saya dapat membantu sesame dalam jangkauan besar.',	'Saya berorganisasi semenjak di Sekolah Menengah Pertama. Di SMP pengalaman saya berorganisasi saya dapat pergi ke luar pulau untuk mengikuti lomba dan mendapatkan hasil yang cukup yaitu Juara 3 Lomba Tari tingkat Nasional dalam kegiatan Kemah Budaya Nasional. Saya dan rekan se tim saya mewakili Jawa Tengah. Prestasi tersebut saya dapat karena mengikuti organisasi pramuka. Kegiatan kepramukaan saya tidak berhenti di SMP saja, di SMA saya melanjutkan organisasi pramuka dan menjadi salah satu anggota pengurus organisasi. Pada tahun kedua saya menjabat sebagai Kepala Bidang Pembinaan dan Pengembangan. Bidang tersebut berfokus pada pembimbingan calon anggota pramuka baru pada tingkat dibawah saya. Pada bidang ini terdapat suatu program kerja yaitu Bakti Sosial, dan saya menjadi Koordinator Acara program kerja tersebut. Pada masa kuliah di semester ke 2 saya mengikuti organisasi Himpunan Mahasiswa Teknik Sipil Unsoed dan menjadi staff di divisi Minat Bakat. Saya memilih divisi tersebut karena dua hal, yang pertama yaitu karena saya ingin mengembangkan bakat tari saya dan yang kedua saya tertarik dengan salah satu program kerja  dari divisi tersebut yaitu Bakti Sosial. Saya diamanahi untuk menjadi Ketua Pelaksana dari program kerja bakti sosial di himpunan ini. Sekarang saya sudah dua periode dalam berorganisasi di himpunan dan pada periode kedua ini pun saya memegang program kerja Bakti Sosial kembali. Pada tahun ini juga saya menjadi bagian dari lingkar pengabdian masyarakat se universitas UNSOED. Saya merasa senang dan bangga karena dapat menolong dan membantu sesama manusia melalui jalur ini.',	1,	1655742827,	NULL,	0),
('SCHLR-NGGRS-5f6823',	'USR-NGGRS-f4633',	'Anggi Ariska Putri',	'2004-03-14',	'89515461614',	'Kedungdowo, RT 04/RW 10, Kismoyoso, Ngemplak, Boyolali',	'Akuntansi Syariah-Fakultas Eko',	'Universitas Islam Negeri Raden',	'9.36',	'1',	'Halo, perkenalkan nama saya Anggi Ariska Putri. Saya lulusan dari SMA Negeri 1 Ngemplak. Saya melanjutkan pendidikan di UIN Raden Mas Said Surakarta dengan jurusan Akuntansi Syariah (Mahasiswa Baru). Saya memiliki semangat yang tinggi untuk terus mengejar mimpi, saya sangat menyukai belajar, apalagi yang banyak tantangannya. Saya ingin menjadi educator dan \'Agent of Change\' untuk generasi muda lainnya. Saya memiliki kepribadian yang murah senyum, menurut saya itu dapat mengurangi stress. Saya tidak menyukai orang yang menggunakan waktunya untuk hal -hal yang kurang penting, itu menjadi salah satu hal yang ingin saya ubah. Mengubah orang lain itu memang tidak mudah, makanya saya ingin memulainya dari diri sendiri, keluarga, masyarakat, kemudian baru ke lingkup yang lebih luas.\r\n\r\n#Sebelumnya mohon maaf kak, pada GPA saya isi rata-rata raport kelas 12 semester 2 (93,6) , karena saya belum memiliki GPA saat ini (Mahasiswa Baru).',	'Impian terbesar saya adalah ingin mengangkat derajat orang tua, dengan menjadi orang yang sukses. Saya ingin menjadi seorang pengusaha besar, pembisnis yang handal, dan ilmuwan matematika. Untuk menjadi seorang pengusaha dan pembisnis yang handal, saya harus menguasai manajemen keuangan dan akuntansi. Itu sedang proses dan akan segera saya jalani. Selain itu, dalam kehidupan sehari-hari, saya juga mencoba untuk online shop dan belajar menyusun manajemen keuangan,serta melatih skill berhitung dengan teliti. Saya juga membiasakan diri dengan menghitung pemasukan & pengeluaran sehari-hari. Kegiatan yang berkaitan dengan angka/hitungan, akan saya susun agar lebih terkoordinir dan membangun habitat atau kebiasaan sesuai passion & impian.',	'Ya, saya memiliki pengalaman organisasi. Pertama, saya pernah menjadi seorang ketua dalam ekstrakurikuler teater yang jobdesknya adalah mengatur, mengingatkan, memotivasi, serta mengarahkan anggota lain agar tetap berjalan dengan lancar. Yang kedua, dari SD-SMA saya selalu menjadi sekertaris, dimana jobdesknya adalah merekap dan menulis sesuatu yang penting. Yang ketiga, saya menjadi tim media pada Rumah Cendekia Boyolali, sebuah organisasi yang membantu mengembangkan dan membina karakter para pemuda/i daerah Boyolali agar memiliki motivasi tinggi untuk mengejar mimpi,dimana jobdesknya adalah merekam dan memotret jalannya kegiatan yang dilaksanakan dalam waktu yang ditentukan. Dari Rumah Cendekia Boyolali, saya dan kelompok saya membuat suatu kegiatan yaitu \'Sinaw Bareng\', tujuannya adalah meningkatkan minat baca disuatu desa yang ada di Boyolali dengan cara meminjamkan buku kepada para pemuda/i.',	1,	1655734755,	NULL,	0),
('SCHLR-NGLBT-df8d52',	'USR-NGLBT-60257',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654236849,	NULL,	0),
('SCHLR-NGLNV-fe1ca2',	'USR-NGLNV-d638a',	'Angelina Veronika Gee',	'2004-07-05',	'82276003035',	'Sumatera utara Kabupaten Nias Selatan kota telukdalam ',	'IPA',	'SMA SWASTA KATOLIK BINTANG LAU',	'3.78',	'0',	'Hai perkenalkan nama lengkap saya Angelina Veronika Gee, biasa dipanggil/nama panggilan Veron. Saya anak ke 2 dari 5 bersaudara. Saya kakak pertama perempuan. Umur saya skarang 17 tahun dan baru lulus bulan kemarin. Sebelumnya saya ingin ceritakan masa2 sulit saya dimana keadaan saya dulu sangat baik baik saja tetapi setelah ayah meninggal semuanya hancur.. Di keluarga hanya ayah saya yang bekerja, pekerjaan ayah hanya meperbaiki papan selancar karena rumah dekat dengan pantai jadi banyak wisatawan yang berlibur untuk selancar. Bisa dibilang kebutuhan kadang tercukupi kadang tidak tetapi ketika ayah meninggal dunia pada tahun 2018 semuanya begitu kacau.. Keadaan memaksa harus begini.. Semuanya dipaksa dewasa akan hal itu.. Tetapi beruntung mama masih kuat untuk menafkahi anak2nya mama sangat hebat???? Kami yakin kami pasti bisa sukses kedepannya..  Agar membahagiakan Mama❤️',	'Jujur, saya belum punya mimpi yang besar. Saat ini prioritas saya naik turun, dengan kata lain belum punya tujuan yang pasti. Tapi selain beribadah minta yang terbaik, 1 hal yang membuat saya \'agak\' tenang adalah mencoba terus, berhasil lagi gagal lagi, sampai saya bisa menetapkan mana yang klop, mana yang saya cari.\r\n\r\nKarena dengan cara itulah saya berusaha dan merasa sudah melakukan sesuatu yang produktif.',	'Iya ada tetapi waktu sekolah kita setiap bulan memberikan kebutuhan untuk anak yatim piatu.. ',	1,	1654269122,	NULL,	0),
('SCHLR-NGSTR-81b581',	'USR-NGSTR-f7c8c',	'Angesti Arina Pramudita',	'2003-08-08',	'82242136825',	'Perum Ayodya Citra, Depok, Sleman, Yogyakarta',	'Teknologi Pangan dan Hasil Per',	'Universitas Gadjah Mada',	'3.58',	'2',	'Nama saya Angesti Arina Pramudita saya bersekolah di SMA N 6 Yogyakarta dan saat ini saya menjadi mahasiswa aktif jurusan Teknologi Pangan dan Hasil Pertanian Universitas Gadjah Mada. Saya memiliki minat dalam mengembangkan industri makanan. Saya aktif mengikuti kegiatan dalam kampus seperti organisasi Himpunan Mahasiswa dan menjadi Panita PPSMB UGM 2022 (Pelatihan Pembelajar Sukses bagi Mahasiswa Baru Universitas Gadjah Mada). Saya senang ketika bertemu dengan orang baru dan mengikuti sosial event. Saya senang saat ini pandemi mulai berakhir saya dapat bertemu orang secara langsung, berkomunikasi secara langsung, dan bertatap muka secara langsung. Kelebihan yang saya miliki adalah saya orang yang terorganisir dalam mengatur suatu hal. Saya selalu menetapkan tujuan-tujuan yang ingin saya raih dan cara bagaimana saya dapat meraih tujuan saya. Kekurangan yang saya miliki adalah saya tidak dapat mengekspresikan diri dengan baik di tengah orang banyak. Namun, ketika saya SMA dan bergabung dalam kepanitiaan acara saya memberanikan diri untuk menyampaikan ide-ide dan pendapat saya sehingga saya dapat bekerja sama dalam tim dan diberi kepercayaan untuk memimpin suatu divisi. \r\n',	'Mimpi terbesar saya adalah dapat bekerja dalam Research and Development in Food Industry dan dapat menciptakan produk baru dalam food and beverage. Oleh karena itu, saya berkuliah di jurusan teknologi pangan. Hal yang saya lakukan untuk meraih cita-cita saya adalah belajar dengan tekun dan berusaha untuk lulus dengan cumlaude. Saya selalu menetapkan tujuan yang ingin saya capai pada setiap semester. Pada semester 3 saya berencana untuk mengikuti organisasi GIRL UP yang sudah tersebar dalam 125 negara dan terdapat juga GIRL UP UGM yang akan saya ikuti. Organisasi tersebut bergerak dalam bidang  kesetaraan gender dan perubahan sosial. Selain itu, saya juga ingin mengikuti beberapa keapanitiaan event dalam kampus. Pada Semester 4 saya berencana untuk mengikuti SP2KM UGM yang bertujuan untuk mengembangkan karakter kepemimpinan mahasiswa dan membentuk mahasiswa menjadi “strategic leader” yang adaptif, kreatif, dan empati yang mampu memimpin, menyelesaikan masalah, memberi solusi, dan inspiratif dan menjadi asisten praktikum di kampus. Pada semester 4 juga saya ingin mengikuti beasiswa ke luar negeri atau magang di perusahaan industri makanan dan pada semester selanjutnya fokus pada perkuliahan untuk lulus tepat waktu. \r\n',	'Ketika SMA saya aktif mengikuti kepanitiaan event sebagai divisi humas. Jobdesk yang saya lakukan adalah bekerja sama dengan media partner mulai dari membagikan proposal, follow up, negoisasi, dan MoU. Event yang saya ikuti cukup beragam seperti pementasan theater, lomba basket antar pelajar SMP se-DIY, charity, konser live music, dll. Selain itu dibeberapa event saya bekerja sama dengan panti asuhan, bertanggung jawab piala walikota. Saya pernah diberi kepercayaan sebagai koordinator humas dalam event drama musikal di sekolah dan event try out pelajar SMP. Saat ini saya berkuliah di Universitas Gadjah Mada (UGM) dengan jurusan Teknologi Pangan dan Hasil Pertanian angkatan 2021. selama berkuliah 2 semester saya tergabung dalam organisasi KMTPHP UGM (Keluarga Mahasiswa Teknologi Pangan dan Hasil Pertanian UGM) dalam departemen jaringan eksternal. Dalam organisasi ini saya berkesempatan untuk menjadi moderator dalam webinar yang bertemakan copy writing dan public speaking. Selain itu, saya juga tergabung dalam divisi humas pembuatan yearbook dan divisi acara dalam event expo sma. Selain itu, saat ini saya tergabung dalam panitia PPSMB UGM 2022 (Pelatihan Pembelajar Sukses bagi Mahasiswa Baru Universitas Gadjah Mada) dalam divisi co-fasilitator. Divisi co-fasilitaor yang bertugas untuk menyampaikan materi tentang UGM, melakukan penilaian yang ditugaskan, menjadi role mode bagi mahasiswa baru, dan menangani mahasiswa yang bermasalah. Selama menjadi panitia PPSMB UGM 2022 saya mendapatkan pelatihan tentang public speaking dengan trainer dari UGM\r\n\r\n',	1,	1655699150,	NULL,	0),
('SCHLR-NHSHF-ee0526',	'USR-NHSHF-42b5c',	'Nuha Shofiya',	'2003-02-04',	'85799831823',	'Desa Jetis Rt 4 Rw 2 Kecamatan Kemangkon Kabupaten Purbalingga',	'Okupasi Terapi',	'Poltekkes Surakarta',	'0.00',	'0',	'Perkenalkan nama saya Nuha Shofiya kelahiran tahun 2003. Saya adalah anak gapyear tahun 2021 dan sedang bersiap masuk kuliah dengan jurusan Okupasi Terapi. Masa SMP-MA saya memilih sekolah di luar kota karena termotivasi dari pengalaman saudara yang menjadikan saya ingin berpetualang di kota lain. Pengalaman ini pun membantu saya untuk hidup mandiri, mengelola keuang, melatih komunikasi dan manajemen waktu yang terbagi dengan kegiatan aktif dalam berorganisasi, menambah hafalan Al-Quran dan tidak ketinggalan dalam akademis.',	'Selalu saya jawab “Bermanfaat bagi orang lain” Meskipun dulu jawabannya masih terlalu umum tapi sekarang saya jawab yang relevan dengan jurusan saya ambil yaitu, Terapi Okupasi. Saya mau membantu anak berkebutuhan khusus untuk bisa menemukan potensi dalam diri mereka sehingga mampu hidup mandiri dan menjadi versi terbaiknya. Dengan begitu mereka bisa percaya diri ketika bersosialisasi di masyarakat yang sering memandang mereka sebelah mata. Membuka klinik dan berkolaborasi dengan Sekolah Inklusi adalah salah satu yang saya rencanakan untuk mewujudkannya. Serta saya bermimpi mampu bersaing di kancah internasional melalui program yang diberikan oleh YBB.',	'Sudah sejak SMP pengalaman organisasi saya dimulai, saya terpilih menjadi anggota OSIS. Di jenjang MA saya terpilih menjadi sekretaris organisasi kesiswaan sekaligus Dewan Ambalan meskipun demikian tidak terjadi kesenjangan sosial dan bentrok antar organisasi karena jumlah siswa yang mengharuskan rangkap jabatan. Di masa gapyear pun saya tetap aktif mengasah diri saya, ada dua kegiatan yang paling saya tekuni saat itu dan salah satunya adalah menjadi relawan guru sekolah alam di daerah saya selama 3 bulan. Sekolah dengan metode belajar bersama alam dan mengembalikan potensi anak pada fitrahnya. Saat itu saya diamanahi untuk membantu guru ABK sekaligus menjadi shadow teacher bagi anak berkebutuhan khusus. Tentunya ini adalah dunia baru bagi saya, dimana saya harus membantu pembelajaran bagi anak berkebutuhan khusus dan bertemu dengan dunia kerja lingkup pendidikan, dan saya diharuskan untuk cepat beeradaptasi dengan anak-anak serta lingkungannya. Melihat ada perkembangan dari anak-anak meskipun kecil adalah suatu kebahagiaan tersendiri yang saya rasakan. Dari perjalanan ini saya menyimpulkan, ternyata masih banyak pengalaman yang harus saya jemput diluar sana.',	1,	1655715253,	NULL,	0),
('SCHLR-NJMTH-fc4c81',	'USR-NJMTH-dea56',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655737436,	NULL,	0),
('SCHLR-NJWSF-a2e75e',	'USR-NJWSF-19acb',	'NAJWA SAFFA AMEERA',	'2003-06-20',	'85655492429',	'Dsn.kepatihan RT 001 Rw.001 ds.bendungan kec.kudu kab jombang',	'Manajemen',	'UPN veteran Jatim ',	'3.94',	'2',	'Saya saya adalah seorang pribadi yang aktif yang tidak pantang menyerah selalu mau mencoba hal-hal yang baru saya dari kecil sudah terbiasa untuk kehidupan diri dan terbiasa kerja keras tidak pantang menyerah. Saya adalah pribadi yang haus akan ilmu dan selalu mau mencoba hal-hal yang baru. Saya orangnya di situ tepat waktu dan rajin',	'Mimpi terbesar saya adalah menjadi seorang pengusaha sukses dan bisa menambahkan daya ke derajat orang tua saya. Cara saya untuk mewujudkan mimpi-mimpi saya yaitu dengan saya bekerja keras dan tidak pantang menyerah, selalu mengambil peluang yang ada, tidak menyia-nyiakan kesempatan, berani mencoba dan mengambil resiko, saya akan memulai bisnis dari kecil dan saya tidak akan pernah menyerah sambil bisnis yang akan saya jalankan adalah bisa petunjuk berkembang menjadi besar dan menjadi akar dari kesuksesan saya.',	'Saya memiliki banyak pengalaman organisasi dan kepanitiaan. Di SMA saya aktif di beberapa organisasi yang fisik seperti taekwondo dan basketball, saya juga sering mengikuti kompetisi dengan memenangkan salah satu kejuaraan taekwondo menjadi juara 1 tingkat provinsi. Saat kuliah saya aktif di beberapa organisasi dan kepanitiaan, masih aktif di organisasi ikatan Mahasiswa Jombang universitas pembangunan veteran Jawa Timur, aktif organisasi himpunan pengusaha muda UPN veteran Jawa Timur, aktif di UKM penalaran dan kreativitas, saya juga aktif di beberapa kepanitiaan kampus seperti festival UMKM dan beberapa kepanitiaan di organisasi yang saya ikuti. Saya sering di bidang sponsor atau pendanaan, dan saya juga pernah jadi koor dan anggota direvisi tersebut.',	1,	1655742045,	NULL,	0),
('SCHLR-NJWSL-ddd1dc',	'USR-NJWSL-ee49d',	'Najwa Salimah',	'2002-11-17',	'85795291339',	'Jl. Margacinta no. 192 rt.01/rw.07 kel. cijawura kec. buah batu, Bandung, Jawa Barat',	'manajemen',	'Universitas Muhammadiyah Bandu',	'4',	'2',	'Saya Najwa Salimah, saat ini sedang menjalani perkuliahan semester 2 sebagai mahasiswa manajemen di Universitas Muhammadiyah Bandung. Saya senang bersosialisasi serta berorganisasi sehingga mampu meningkatkan jiwa kepemimpinan dan kemampuan berkomunikasi saya. Di SMP dan SMA saya aktif mengembangkan diri dalam organisasi OSIS serta mengikuti ekskul keagamaan dan beberapa kali mengikuti kompetisi dibidang beladiri serta keagamaan. Saya berharap dengan pengalaman saya tersebut menjadikan saya kandidat yang tepat untuk menerima beasiswa ini, karena saya ingin sekali memperluas pengalaman serta mengembangkan skill yang saya miliki melalui program program yang beasiswa ini tawarkan.',	'Mimpi terbesar saya adalah bisa lulus S1 dengan IPK yang tinggi lalu kemudian dapat melanjutkan pendidikan ke jenjang yang lebih tinggi, yaitu S2 dengan dibantu beasiswa, kemudian saya bisa mendapatkan pekerjaan yang baik dan layak sehingga mampu membantu perekonomian keluarga dan orangtua saya dapat menikmati masa tuanya dengan tenang. Tentu untuk mewujudkan mimpi saya tersebut saya harus bekerja keras dan bersungguh sungguh dalam belajar dan juga di imbangi dengan mengembangkan soft skill dan hard skill yang saya miliki, terus memperluas relasi serta pengalaman saya dengan aktif mengikuti keorganisasian didalam maupun diluar kampus, kemudian tak boleh lelah untuk mencari beasiswa untuk meringankan beban orang tua.',	'Iya, Saya memiliki pengalaman organisasi. Saat SMP saya  pernah diamanahkan untuk menjadi Wakil ketua OSIS selama satu periode dan berhasil melaksanakan proker proker OSIS dengan baik, kemudian di SMA saya pernah diamanahkan juga untuk menjadi Ketua Keputrian selama satu tahun yang dimana saya juga berhasil menjalankan proker proker dengan baik, lalu saya juga mengikuti keorganisasian rohis dan cukup aktif mengikuti kepanitiaan sehingga pernah menjadil ketua salah satu divisi kepanitiaan.',	1,	1654411447,	NULL,	0),
('SCHLR-NKGNG-4f0603',	'USR-NKGNG-5ccb6',	'Anak Agung Istri Wiryastiti',	'2002-12-26',	'81338088535',	'Banjar Tatiapi Kaja,  Pejeng Kawan, Tampaksiring, Gianyar, Bali',	'Agribisnis fakultas pertanian',	'UNIVERSITAS UDAYANA',	'3.95',	'2',	'Haii kenalin nama saya Anak Agung Istri Wiryastiti bisa dipanggil tyas. Saya anak pertama dari dua bersaudara. Saya punya mimpi besar dalam mencegah stunting dan gizi buruk yang dialami oleh anak-anak indonesia. Saya orangnya sangat menyukai tantangan dalam hidup ',	'Mimpi terbesar saya, saya ingin mengentaskan stunting dan gizi buruk anak-anak indonesia.',	'Saya dimasa SMA mengikuti organisasi PMR saya sangat senang sekali menolong seseorang dan membuat mereka tersenyum adalah kebahagiaan bagi saya',	1,	1654437269,	NULL,	0),
('SCHLR-NKSYH-036bde',	'USR-NKSYH-0a589',	'Anaksya Haq',	'2003-06-25',	'89650524366',	'Griya Praja Mandiri Blok E2 No 09, Cibeber, Kota Cilegon, Banten',	'Manajemen',	'IPB University',	'3.69',	'2',	'Saya adalah orang yang berorientasi masa depan, pekerja keras, bertanggung jawab, dan suka berdiskusi dalam segala hal.',	'Mimpi terbesar saya adalah dapat menciptakan financial freedom dalam kehidupan saya. Cara saya untuk mewujudkannya adalah dengan mengumpulkan ilmu dan pengalaman yang mumpuni sebagai pondasi awal untuk proses dari financial freedom itu sendiri.',	'Pada masa SMA, saya pernah mengikuti OSIS dan pernah menjabat sebagai sekretaris dalam salah satu program kerjanya. Di masa kuliah, saya mengikuti organisasi BEM KM di IPB sebagai staf dan juga penanggung jawab sebuah program kerja seorang diri. Untuk pengalaman relawan, saya sedang menjalani program relawan mengajar yang diadakan oleh program studi saya, yaitu manajemen, di sebuah sekolah khusus untuk anak-anak pelosok di Kabupaten Bogor.',	1,	1655743519,	NULL,	0),
('SCHLR-NLNRH-d7f4ef',	'USR-NLNRH-6f925',	'Nilnarohmah',	'2002-09-26',	'82335449221',	'Ds/Kec. Bluluk Kab. Lamongan Jawa Timur',	'Desain/DKV',	'Institut Seni Indonesia Yogyak',	'3.60',	'1',	'Saya adalah pribadi yang antusias dalam segala hal, terutma pendidikan dan kegiatan organisasi. Saya yakin dengan kedua bekal yang saya geluti ini nantinya dapat sangat bermanfaat juga membantu dimasa depan saya nanti. Selain itu saya adalah pribadi yang periang suka bergelut di dunia komunikasi dan juga creative, saya kecil sangat suka menggambar dan juga bercerita yang endingnya menghantarkan saya kepada bidan seni dan komunikasi yang sangat saya senangi dan geluti saat ini. Overthinking adalah hal terbesar yang terkadang membuat gagal rencana besar saya. Namun disitu juga saya selalu menanamkan pada diri sendiri untuk tetap kuat dan juga sabar untuk mengarungi kehidupan ini.',	'Mimpi terbesar saya ada bisa sukses sedari dini (konteks nya sukses di kehidupan, pendidikan, karir, dan juga percintaan). Saya ingin sekali mewujudkan impian orang tua saya yang ingin berkunjung ke baitullah, oleh karenanya saya yakin bahwa ketika saya sukses pasti akan bisa berkunjung kesana bersama keluarga.',	'Iya, Alhamdulillah saya menjabat dibeberapa posisi organisasi dari semenjak SD sampai perguruan tinggi. Mulai dari ketua kelas (SD), sekertaris dan ketua Pramuka (SMP dan SD ), ketua asrama (SMP), ketua OSIS putri (SMA), sie pendidikan dan sekertaris (pondok/SMA), sie kesenian (SMA), Koord div. Media (PMII UGM) dan masih banyak lagi. Yang kesemuanya itu sangatlah memberikan saya pengalaman dan juga ilmu yang tak terlupakan.  Harapan saya dengan adanya berbagai organisasi yang dulunya pernah saya ikuti semoga dapat bermanfaat dikemudian hari',	1,	1654061489,	NULL,	0),
('SCHLR-NMHRN-ad2906',	'USR-NMHRN-a668d',	'AINI MAHARANI ',	'2004-10-31',	'88261372878',	'Medan amplas harjosari 1',	'Ilmu komputer',	'Universitas Sumatera Utara',	'0.00',	'1',	'Saya Aini maharani mahasiswa baru Universitas Sumatera Utara jurusan ilmu komputer. Saya tamatan MAS MUALLIMIN UNIVA dan saya juga tidak pernah menyangka bakal lolos snmptn di USU karena saya sama sekali tidak pernah kepikiran buat mengambil jurusan ilmu komputer. Alasan pertama saya mengambil jurusan tersebut karena saya lihat prospek kerja untuk masa depan saya lebih terjamin dengan saya mengambil jurusan tersebut dan dimana sekarang ini kita tau bahwa dunia teknologi semakin canggih, maka dari itu saya ingin menjadi salah satu orang yang mengembangkan dunia teknologi untuk masa depan indonesia dan alasan yang kedua saya ingin membangkitkan ekonomi keluarga. Hobi saya bermain mobile legend dan membuat kue. Saya dua bersaudara, kakak saya kuliah di uinsu. Ayah saya bekerja jualan jajanan dikedai² dan ibu saya ibu rumah tangga.',	'Mimpi terbesar saya ingin menjadi programmer yang handal yang bisa membuat aplikasi atau web yang bermanfaat untuk masa depan indonesia contohnya aplikasi pembelajaran.\r\nCara saya mewujudkannya saya akan belajar diperkuliahan dengan sungguh-sungguh dan memanfaatkan waktu untuk terus belajar dan mencoba hal yang baru untuk saya didunia teknologi seperti belajar coding, membuat web, dll. Dan pastinya semua impian tidak akan terwujud apabila kita tidak mau berusaha dan terus berdoa kepada Allah Swt dan dukungan dari orang tua dan teman-teman saya',	'Ya, saya pernah menjadi anggota disebuah organisasi sekolah dalam mengadakan lomba semarak LPTQ MUALLIMIN UNIVA disana saya bertugas menjadi pembina peserta lomba dan mencari dana proposal keuangan untuk lomba. Saya rasa sangat seru bisa masuk organisasi ini dan bisa merasakan kerja sama bareng tim.',	1,	1655714644,	NULL,	0),
('SCHLR-NMKHN-e1a85c',	'USR-NMKHN-edc8f',	'Naomi khansa',	'2003-09-09',	'81387822905',	'jl.pramuka raya no.15,Matraman,Jakarta Timur',	'Manajemen',	'Universitas Singaperbangsa Kaw',	'3.56',	'2',	'Saya Naomi Khansa Zalty mahasiswa Universitas Singaperbangsa Karawang semester 2 prodi manajemen',	'saya ingin menjadi wirausahawan yang sukses karena itu saya mengambil pendidikan S1 manajemen dan setelah lulus S1 saya ingin menambah pengalaman untuk membuka bisnis dengan bekerja',	'Iya,yaitu menjadi divisi fundraising di salah satu organisasi kampus, saya bisa melaksanakan program divisi sesuai dengan timeline nya dan menjadi divisi acara untuk program diesnatalis ULCC 2022 (unsika language culture club)',	1,	1654563164,	NULL,	0),
('SCHLR-NNDHM-02e55e',	'USR-NNDHM-fcc28',	'Annida Hamidah',	'2003-11-01',	'82159199811',	'Jl.panjaitan 1 GG. Tiung andai ',	'Major hukum ekonomi syariah',	'Universitas IAIN palangkaraya',	'3.65',	'2',	'Saya mahasiswa dari universitas IAIN palangkaraya, saat ini sedang menjalani semester 2 jurusan hukum ekonomi syariah, saya anak pertama dari 3 bersaudara,saat ini saya juga sedang mengikuti beasiswa dari Türkiye buslari untuk bisa berkuliah S1 kesana, saya pernah menjadi juara 3 pada lomba essai dan menang dalam beberapa lomba puisi, saya sangat suka membuat essai dan menuangkan ide pikiran dengan menulisnya di kertas dan karna sebentar lagi libur semester saya berniat untuk magang. ',	'Mimpi terbesar saya yg pertama ingin menempuh pendidikan yg setinggi tingginya, saya mempunyai mimpi untuk bisa kuliah di luar negri terutama turki entah S1 maupun S2 saya yakin saya mampu, kurangnya finansial ekonomi dari keluarga saya bukan menjadi halangan saya untuk bisa berpendidikan setinggi tingginya, dengan sedikit membantu keuangan keluarga saya juga sering menjual baju dan lain lain untuk membeli kebutuhan saya sendiri dan libur semester ini insyaallah akan saya isi dengan magang untuk membantu kedua org tua saya, karena berkeinginan kuliah di luar negri khususnya Turki saya pernah mengikuti kelas belajar gratis Turki secara online, walaupun tidak ada biaya untuk ikut kursus bahasa, saya tetap berusaha mencari beasiswa bahasa Turki secara online dan saya juga belajar bahasa Inggris secara otodidak media sosial saja, saya yakin walaupun tidak ada biaya bukan menjadi halangan untuk saya dengan memanfaatkan media sosial dan lain lainnya',	'Saya pernah menjadi panitia dalam kegiatan Pramuka yg di laksanakan di pantai ujung Pandaran sekitar 2 mingguan.',	1,	1654582025,	NULL,	0),
('SCHLR-NNDKS-b2f8c8',	'USR-NNDKS-41445',	'Nanda kaswari',	'1999-01-21',	'87850143499',	'Suradadi kecamatan Terara kabupaten Lombok Timur',	'Pariwisata',	'Sekolah Tinggi Pariwisata Mata',	'3.44',	'2',	'Nama saya nanda Kaswari saat ini \r\nsaya sebagai mahasiswa di salah satu perguruan tinggi swasta mataram saya mengambil jurusan S1 program studi pariwisata saya adalah anak yang cepat beradaptasi dengan lingkungan serta saya anak yang rajin membaca ',	'Mimpi saya adalah menjadi seorang guru serta saya akan mewujudkannya dengan rajin belajar dan membaca ',	'Ya saya memiliki pengalaman organisasi di salah satu perguruan negeri Lombok program studi D3  Tata hidang di politeknik pariwisata lombok sebagai senat Mahasiswa bagian pelatihan dan pendidikan dan saat ini saya ikut berkecimpung di organisasi karang Taruna Desa suradadi',	1,	1653956316,	NULL,	0),
('SCHLR-NNDKS-fe9b68',	'USR-NNDKS-41445',	'Nanda kaswari',	'1999-01-21',	'87850143499',	'Suradadi kec. Terara kab. Lombok Timur Ntb ',	'Pariwisata',	'Sekolah Tinggi Pariwisata Mata',	'3.44',	'2',	'Nama saya adalah nanda kaswari saya seorang mahasiswa di salah satu perguruan tinggi swasta yang ada di mataram, saya bertanggung jawab, beradaptasi cepat dan memilikimi minat belajar yang tinggi, belajar dari setiap pengalaman dan kesalahan ',	'Mimpi saya terbesar bisa berkontribusi kepada masayarakat agama nusa dan bangsa, cara saya mewujudkan kannya dengan, slalu belajar, membaca yang rajin, mengikuti pelatihan dan seminar, yang terpenting istiqomah dengan tujuan ',	'Saya memiliki pengalaman sebagai seorang senat Mahasiswa dan juga sekarang ini saya menjadi anggota karang taruna didesa suradadi dan saya pernah menjadi relawan penggalangan dana untuk masyarakat Lombok Utara sebagai tempat teraparah kerusakan gempa tempo dulu dan masih banyak lainnya',	1,	1654040432,	NULL,	0),
('SCHLR-NNDRB-706b94',	'USR-NNDRB-9c773',	'Anandira Bizanti Ummaya',	'2003-06-06',	'81284704146',	'Jl h djabir rt 001/05 no 22, kel. bintaro, kec. pesanggrahan, jakarta selatan 12330',	'Fakultas Ilmu Sosial dan Ilmu ',	'UPN Veteran Jakarta',	'3.81',	'2',	'Saya merupakan anak pertama dari 2 bersaudara. Saya merupakan orang yang optimis, pendengar yang baik, kompetetif, ambisius, easy-going, kreatif, dan senang bersosialisasi. Dan saya memiliki hobby bernyanyi.',	'Mimpi terbesar saya yang pastinya membanggakan orang tua dengan prestasi yang saya miliki dan dengan kesuksesan saya nanti. Saya sangat bercita-cita untuk bekerja di KBRI-Seoul. Maka dari itu cara saya mewujudkannya yaitu dengan belajar sungguh-sungguh sejak saya menduduki bangku sekolah, sehingga akhirnya saya mendapatkan SNMPTN di UPN Veteran Jakarta. Dan saya memilih prodi Ilmu Politik karena jurusan tersebut dekat dengan cita-cita yang saya miliki yakni bekerja di KBRI. Dan saya juga sudah mulai latihan bahasa korea secara otodidak. Itulah cara saya untuk mewujudkan mimpi saya.',	'Saya memiliki pengalaman organisasi dan kepanitiaan saat di bangku sekolah. di SMAN 87 Jakarta, saya pernah menjabat sebagai bendahara OSIS selama 1 periode. Saya juga pernah menjadi wakil ketua di dalam kepanitiaan pembuatan Buku Tahunan Sekolah. Serta saya juga selalu ikutserta dalam kepengurusan perangkat kelas.',	1,	1653970074,	NULL,	0),
('SCHLR-NNGSM-6547da',	'USR-NNGSM-55d83',	'Neng Isma Nur Holifah',	'2001-09-30',	'83873269137',	'Jl. Raya barat no 76 RT 01 RW 02 desa sadawangi kec lemahsugih kab Majalengka',	'Ilmu Al-Qur\'an dan Tafsir',	'UIN Sunan Gunung Djati Bandung',	'3.84',	'2',	'Halo, namaku Neng Isma Nur Holifah biasa dipanggil Neng Isma asli dari Majalengka. Saat ini, aku sedang menempuh pendidikan S2 di UIN Sunan Gunung Djati Bandung prodi Ilmu Al-Qur\'an dan Tafsir tepatnya semester 2 akhir. Aku memiliki sebuah hobi yaitu public speaking, aku sangat suka berbicara di depan umum dan sekarang aku sedang menekuni hobiku agar bisa menjadi modal untuk prestasi dan kebermanfaatan bagi orang lain. Oh ya, aku adalah anak sulung atau anak pertama dari tiga bersaudara semua adikku perempuan dan mereka menjadi masa depan yang harus aku perjuangkan. Pendidikan mereka menjadi targetku setelah aku sukses dalam pendidikan dan karierku nanti. Satu keyakinan yang ku pegang saat ini \"tak ada hal mustahil dalam hidup ini, kuncinya hanya satu -Mulailah dan selesaikan apa yang kau mulai- karena aku yakin segala sesuatu hanya tentang siapa yang berani memulai dan berjuang menyelesaikan nya\"',	'Mimpi terbesar ku adalah pergi haji bersama kedua orang tuaku, menyelesaikan pendidikan ku setinggi-tingginya, dan menebar kebermanfaatan bagi umat.\r\nAdapun usaha yang aku lakukan untuk mewujudkan mimpi2 besarku itu adalah\r\n- meluruskan dan menguatkan tekad berhaji dalam hati karena haji bukan hanya soal finansial tapi tentang tekad dalam hati yang membawa kita ke tanah suci\r\n- berusaha untuk belajar semaksimal mungkin dan berusaha untuk mencari beasiswa pendidikan agar pendidikan ku tidak terhalang oleh masalah finansial keluarga\r\n- mengasah bakat ku untuk menjadi bekal bagiku untuk bisa bermanfaat bagi umat. Dalam hal ini poin yang ku kejar adalah hal berdakwah dan menciptakan sebuah lembaga yang nantinya bermanfaat bagi umat baik bagi lapangan pekerjaan, finansial, sosial, dan pendidikan',	'Ya, aku termasuk orang yang suka berorganisasi. Aku mulai berorganisasi di sekolah sejak kelas 1 Mts akhir. Adapun organisasi yang pernah aku ikuti adalah OSIS bidang pendidikan, OSIS bidang keagamaan (SMA), OSIS sebagai wakil ketua OSIS (MTs), OSIS sebagai sekretaris umum (SMA), Pramuka bidang kebersihan, seksi acara dalam berbagai acara umum mulai acara di sekolah sampai acara kepemudaan di tingkat nasional.',	1,	1655741449,	NULL,	0),
('SCHLR-NNGST-d91bb3',	'USR-NNGST-d7539',	'Ning ai Satyawati',	'2003-12-11',	'87860150180',	'Banjar dinas Pemaroan Desa Patemon Kecamatan Seririt Buleleng Bali',	'Prodi Ekonomi Pembangunan Falk',	'Universitas Udayana',	'0.00',	'1',	'Saya mahasiswa baru di Universitas Udayana tahun 2022 dengan lulusan SNMPTN, sebelum saya duduk di bangku perkuliahan saya bersekolah di SMKN 1 SERIRIT dengan jurusan Akuntansi Keuangan dan Lembaga, selama duduk di bangku sekolah menengah kejurusan saya diberikan kesempatan untuk mengikuti berbagai kegiatan sekolah maupun di luar sekolah hingga PKL atau magang di salah satu Bank milik BUMN dan saya juga diberikan kesempatan menjadi relawan untuk uji klinis masyarakat mengenai dampak Covid-19 atas naungan Harvard University',	'Mimpi saya paling besar adalah mampu menciptakan lapangan kerja agar tingkat pengangguran di Indonesia berkurang dengan hal ini saya ingun sekali membuka suatu perusahan yang dimana didalam nya ada serangkain anak muda milineall yang mungkin orang-orang tak akan menyangka nya, oleh maka dari itu dari saya duduk di bangku SMK saya mempelajari ilmu-ilmu ekonomi hingga saya lanjutkan ke bangku perkuliahan.',	'Untuk pengalaman organisasi saya diberikan kesempatan menjadi wakil ketua OSIS wakil ketua Pramuka di sekolah Anggota Pramuka di kabupaten dan kecamatan untuk di bangku perkuliahan saya sedang mengajukan diri ke organisasi BEM /HIMA untuk relawan sendiri saya diberikan kesempatan mengikuti \r\nHas participated in the enduring material titled Decolonising Global Health atas activity was designated for 1.00 AMA PRA Category 1 Credit.',	1,	1654055438,	NULL,	0),
('SCHLR-NNLRN-f683f7',	'USR-NNLRN-cf060',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655633742,	NULL,	0),
('SCHLR-NNNGQ-2e1638',	'USR-NNNGQ-5247b',	'Neneng Qori Farida',	'2002-08-06',	'81266831011',	'Jalan Rancabentang No 230 A RT 04 RW 14',	'Agroekoteknologi Pertanian',	'Universitas Brawijaya',	'3.73',	'4',	'Saya adalah mahasiswa UB jurusan agroekoteknologi sem 4. saya merupakan mahasiswa yang mengikuti organisasi, alhamdulillah saya terpilih menjadi wakil menteri PSDM di tahun 2021. Dan di tahun ini saya diamanahkan menjadi menteri PJMO. selain itu juga saya memiliki kelebihan dari rajin. saya tidak terlalu pintar namun saya rajin. saya tidak bisa menunda nunda pekerjaan. Selain itu saya juga merupakan mahasiswa yang mempunya kelebihan dalam publik speaking, bahasa inggris saya tidak terlalu bagus. namun jika menjadi mc moderator saya sudah sering. kemudian saya terbilng orang yang pelupa dan aga sedikit baperan. ',	'mimpi terbesarku adalah mewujudkan keimginan orang tuaku dengan cara sukses dunia dan akhirat. cara mewujudkannya seperti skrg ini saya melalukan kuliah, menjalankan sholat 5 waktu dan berusaha terus menerus berdoa untuk hal hal baik menyertai saya',	'punya. organisasi di eksekutif keluarga mahasiswa FP menjadi wakil menteri PSDM dan menteri PJMO. selain itu juga saya sering menjadi koordinato di bagian divisi acara, salah satunya di PKKMB UB 2020. dan juga saya sering disuruh menjadi mc serta moderator.',	1,	1654068019,	NULL,	0),
('SCHLR-NNSKM-823403',	'USR-NNSKM-25db0',	'Annisa Kamila',	'2003-07-19',	'82384560710',	'Jln. Sawahan Dalam No. 8, Padang',	'Teknik Lingkungan/ S1/ Teknik',	'Universitas Andalas',	'3.45',	'2',	'Saya adalah seorang mahasiswi yang bersemangat penuh untuk mencari peluang-peluang terbaik bagi masa depan saya, meskipun dalam keterbatasan kemampuan ekonomi. Saya percaya bila ada kemauan dan usaha akan ada jalan.',	'Menempuh pendidikan setinggi-tingginya dan berkarir dalam bidang saya yaitu teknik lingkungan, sehingga pekerjaan saya bermanfaat bagi masyarakat luas dan lingkungan.\r\n',	'Menjadi relawan dalam program bakti sosial \"Engineer on Action\" BEM KM FT Unand pada bulan April 2022.',	1,	1655741911,	NULL,	0),
('SCHLR-NNSKR-d96f85',	'USR-NNSKR-129fa',	'Annisa Eka Rahayu',	'2002-09-27',	'81233237480',	'Dusun Kwedenwetan, RT 002/RW 002, Desa Kwedenkembar, Kecamatan Mojoanyar, Kabupaten Mojokerto',	'Prodi Ilmu Komunikasi/ Fakulta',	'Universitas Negeri Surabaya',	'3.68',	'2',	'Saya merupakan seseorang yang mudah pesimis dengan hal baru yang belum pernah saya coba, namun hal tersebut tetap saya hadapi dan saya jalani dan akhirnya membuat saya memiliki pengalaman yang lebih. ',	'Membuat kedua orang tua dan orang sekitar saya tersenyum bahagia, karena kebahagiaan mereka merupakan kebahagiaan saya juga. Bagaimana saya mewujudkannya? Dengan berusaha, belajar menjadi orang yang lebih baik dari sebelumnya.',	'Saat ini saya sedang menjadi anggota Himpunan Mahasiswa Prodi Ilmu Komunikasi dan masuk dalam Departemen Agama. ',	1,	1655726891,	NULL,	0),
('SCHLR-NNSMR-cecde4',	'USR-NNSMR-0a94a',	'Annisa Marsha ',	'2002-12-13',	'81299446991',	'Jl. Mampang prapatan XIII buncit raya no 87 Jakarta Selatan ',	'Prodi Pendidikan Bahasa Arab /',	'Universitas Negeri Jakarta ',	'3.90',	'2',	'Saya merupakan orang yang komunikatif, teratur, dan selalu ingin tahu.  Saya komunikatif karena saya selalu menyampaikan pesan pada lawan bicara dengan jelas dengan menggunakan komunikasi verbal maupun non verbal. Saya juga selalu menuliskan hal-hal yang ingin saya lakukan dalam satu hari di buku atau digital notes, sehingga saya merupakan orang yang teratur. Selain itu, saya juga memiliki rasa keingintahuan yang lebih karena mungkin disebabkan oleh kebiasaan saya yaitu membaca berita online di berbagai sumber terpercaya dan bisa memberikan saya pengetahuan yang bermanfaat bagi diri sendiri dan orang lain. ',	'Mimpi terbesar saya yaitu bisa bermanfaat bagi diri sendiri dan orang lain. Terutama bisa membantu guru² dan siswa siswi di daerah terpencil yang terlambat proses belajar mengajarkan karena kurang tenaga pendidik ataupun fasilitas. Cara mewujudkannya dengan saya belajar dan nanti ingin mengikuti program kampus mengajar yang disediakan oleh pemerintah, sehingga saya dapat menyalurkan lagi ilmu yang saya dapat.\r\nSelain itu mimpi terbesar saya yaitu bisa menguasai beberapa bahasa, saat ini saya sudah menguasai bahasa inggris dan bahasa arab. Cara saya untuk mewujudkannya dengan menambah kosakata setiap hari nya melalui catatan di notes, dan mengikuti lomba-lomba bidang kebahasaan dan public speaking tingkat nasional.',	'Ya, saya saat ini mengikuti organisasi Badan Eksekutif  Mahasiswa Program studi pendidikan bahasa arab UNJ dan Organisasi IMASASI wilayah 3 tingkat Nasional. Tentunya dengan mengikuti organisasi ini, saya mendapatkan hal baru yang dapat saya jadikan pelajaran di hidup saya, dapat bertukar pikiran dengan Mahasiswa dari kampus yang berbeda, relasi, serta wawasan yang luas.\r\nDan tentunya dengan mengikuti organisasi ini dapat menjadi penghubung untuk karir saya di masa depan.',	1,	1653998389,	NULL,	0),
('SCHLR-NNSSF-e7221a',	'USR-NNSSF-0f179',	'Annisa Safanah ',	'2003-11-18',	'85314742942',	'Jalan Gunung Lawu III, No.12, Kota Cirebon, Jawa Barat ',	'IPA',	'SMAN 3 Cirebon ',	'0',	'0',	'Perkenalkan saya Annisa Safanah. Saya lulusan dari SMAN 3 Kota Cirebon jurusan IPA. Selama SMA saya turut aktif dalam mengikuti berbagai kegiatan produktif di lingkungan sekolah maupun luar sekolah, seperti menjadi ketua Karya Ilmiah Remaja, Bendahara MPK, dan staff HRD Pelajar Sastra. Selain itu, prestasi yang saya miliki selama 3 tahun sangat baik. Saya dipercayai untuk mewakili sekolah dalam beberapa perlombaan tingkat Provinsi maupun tingkat Nasional. Alhamdulillah berkat kegigihan dan do\'a orang terdekat, saya diberi kesempatan untuk mendapatkan juara Olimpiade Fisika dan Matematika.\r\n\r\nSelama pandemi, saya mengisi waktu luang dengan mengikuti berbagai perlombaan,volunteer, dan mencari beasiswa. Saya memiliki ambisi yang kuat untuk bisa melanjutkan sekolah ke jenjang perkuliahan dengan beasiswa penuh. \r\n\r\nSaya sangat menyukai hal-hal yang bisa mengembangkan skill pribadi. Saat ini saya sedang mengasah kemampuan saya dibidang digital IT. Saya ingin sekali menjadi ahli IT, terlebih lagi menjadi seorang Data Scientist. Hari-hari saya disibukkan dengan mempelajari tools SQL. \r\n\r\nHarapan saya kedepannya ketika lolos beasiswa YBB ini, saya ingin belajar lebih banyak mengenai tips and trik lolos beasiswa dengan benefit mentoring beasiswa dari kakak-kakak yang tentunya sangat luar biasa. Saya ingin pengalaman baik yang saya tempuh bisa menjadi motivasi untuk penerus bangsa Indonesia kelak. Saya ingin mengembangkan skill agar lebih paham akan ilmu-ilmu yang belum saya kuasai sebelumnya. Saya berharap bisa menjadi bagian dari Awardee beasiswa YBB ini dan dapat mengimplementasikan ilmu yang saya miliki di kehidupan sehari-hari.',	'Mimpi terbesar saya yaitu menjadi manusia yang berguna untuk sesama. Saya ingin sukses di usia muda agar bisa menjadi inspirasi pemuda millenial bangsa. Saya ingin ilmu yang saya miliki, kelak bisa saya bagikan kembali kepada orang lain.\r\n\r\nSaya ingin menekuni dunia IT dan Data Science. Saat ini, saya sedang berusaha mempelajari tools-tools yang diperlukan bagi seorang data scientist. Cara saya mewujudkan mimpi saya yaitu dengan terus berusaha, dan belajar dengan para ahlinya. Saya memiliki kakak kandung yang sudah mahir di dunia IT. Saya adalah tipikal anak yang ingin banyak tau akan ilmu. Maka dari itu, saya selalu menanyakan seputar IT ke kakak saya. Saya sangat senang ketika kemampuan saya sedikit demi sedikit selalu berkembang. \r\n\r\nKetika saya diberikan kesempatan untuk kuliah, saya akan mengambil jurusan IT dengan tujuan mendalami ilmu-ilmu yang belum saya ketahui. Selain itu, Saya sedang berusaha untuk bisa bergabung dengan bootcamp IT Scholarship. \r\n\r\nSaya sangat optimis dengan kemampuan pribadi. Kedepannya saya akan buktikan bahwa saya bisa menjadi inspirasi bangsa di kancah Internasional.',	'Iyaa, sejak kelas 10 saya mendaftarkan diri sebagai OSIS/MPK. Saya menjabat sebagai Bendahara Umum MPK selama 1 tahun. Saat masa jabatan, saya berhasil mendapatkan kategori Bendahara terbaik. Selanjutnya, sejak kelas 11 saya turut aktif mengikuti kegiatan perlombaan, lalu saya diberi tanggungjawab sebagai Ketua Karya Ilmiah Remaja selama 1 tahun masa jabatan. \r\n\r\nSaya turut aktif diberbagai kegiatan organisasi maupun volunteer. Alhamdulillah, Saya berhasil menjadi HRD di komunitas Pelajar Sastra Indonesia tahun 2021/2022. Di dalam komunitas ini, saya memiliki banyak relasi dari berbagai daerah yang bisa diajak sharing pengetahuan dan informasi penting lainnya. Saya mendapatkan pengalaman bagaimana cara kerja dari seorang HRD itu.\r\n\r\nDalam suatu komunitas, saya jadi sangat terbiasa dengan public speaking, Time Management, dan memiliki jiwa pemimpin. Hal inilah yang dapat mengembangkan skill saya kedepannya.\r\n\r\nSejak kelas 10, saya sangat menyukai dengan kegiatan sosial. Saya berhasil mengumpulkan para donatur untuk bisa beramal setiap minggu, khususnya dihari Jum\'at. Saya memiliki lebih dari 100 donatur tetap dan akan terus bertambah setiap minggunya. Selain itu, saya pernah mengikuti berbagai kegiatan volunteer offline maupun online. Saya sangat suka dengan hal-hal yang bisa membuat orang lain bahagia. Terlebih lagi mengenai sedekah.\r\n\r\nHarapan saya kedepannya, saya bisa lebih dari yang sekarang dalam segala aspek. Saya ingin mencari banyak ilmu sebagai landasan hidup pribadi. Jika saya diberi kesempatan untuk menerima beasiswa YBB, saya ingin lebih bisa berguna untuk sesama. Saya ingin mengharumkan Awardee beasiswa YBB dengan cara terbaik yang sudah saya rancang.',	1,	1654531624,	NULL,	0),
('SCHLR-NNSYH-792fa3',	'USR-NNSYH-1b011',	'NENSYAH PERMADANI',	'2004-03-30',	'81553857173',	'Jl. Hayam Wuruk, Dusun Pager, Sawotratap, Kec. Gedangan, Kabupaten Sidoarjo, Jawa Timur',	'MIPA',	'SMAN 1 WARU',	'9.27',	'0',	'perkenalkan nama saya nensyah permadani saya dari SMAN 1 WARU yang telah lulus taun 2022,telah ketrima di politeknik negri jember.selama 3 tahun menjalankan sebagai siswa SMA saya juga aktif mengembangkan diri di salah satu organisasi,saya juga aktif berkompetisi di bidang matematika dan kimia.saya ingin memperluas pengalaman saya dengan mengikuti beasiswa ini,karena program beasiswa ini yang terkenal dengan pendidikan soft skillnya.',	'mimpi terbesar saya adalah ingin melihat orang tua saya selalu bahagia dan membelikan rumah orang tua saya,karna saya tinggal dikoss.cara saya mewujudkan yang pertama,melanjutkan pendidikan yang lebih tinggi karna ayah saya mempunyai mimpi terbesar ingin melihat putrinya dengan pendidikan sarjana saya yakin itu bisa bikin ayah saya bahagia,keterbatasan ekonomi tidak akan menghambat untuk melanjutkan pendidikan yang lebih tinggi.yang kedua dengan saya usaha dan doa orgtua saya yakin bisa lulusan sarjana dan membelikan orgtua saya rumah,karena tujuan ga akan tercapai kalao tidak ada proses.',	'iya,pengalaman saya mengajar les anak SD dan TK,mengikuti organisasi karang taruna,remas(remaja masjid) dan ada lagi organiasi saya disekolah juga mengikuti paskib.',	1,	1655463297,	NULL,	0),
('SCHLR-NNTSY-0853dc',	'USR-NNTSY-9e734',	'Annatasya Firandinni',	'2002-05-15',	'8176311265',	'Kp.Pangkalan RT.06/RW.10, Semanan, Kalideres, Jakarta Barat, DKI Jakarta',	'Akuntansi Perpajakan ',	'universitas padjadjaran',	'3.65',	'2',	'Perkenalkan nama saya Annatasya Firandinni, 20 tahun seorang mahasiswa semester ke 2 di Universitas Padjadjaran. Saat ini saya fokus mengembangkan diri sekaligus berkontribusi dalam lingkungan perkuliahan maupun pendidikan. Saya mengambil studi akuntansi perpajakan, dan ikut serta aktif dalam Badan Eksekutif Mahasiswa Fakultas Ekonomi dan Bisnis. Di BEM saya menempati departemen ekonomi kretif dan keilmuan. Disana saya belajar tentang banyak hal. Selain itu, saya juga mengajar privat untuk sekolah dasar dan calistung. Dari kegiatan yang saya ikuti tersebut saya merasa public speaking dan teamwork saya semakin terasah.',	'Mimpi terbesar saya yaitu memberikan pengajaran untuk seluruh anak di indonesia dalam skala besar. Namun, saya sadar mimpi yang begitu besar tersebut butuh pengorbanan dan dedikasi yang besar. Maka dari itu sedari SMA saya sudah ikut kegiatan mengajar walaupun tidak sejalan dengan jurusan saya. Tapi saya yakin dari hal kecil yang saya mulai, nantinya tujuan besar saya akan tercapai. Maka dari itu saya harap saya berkesempatan untuk mendapat beasiswa ini sebagai bekal untuk memperdalam kemampuan saya untuk mewajibkan mimpi tersebut.',	'Ya, saya punya. Saya sendiri mengikuti banyak organisasi, seperti organisasi kerohanian, dan badan eksekutif mahasiswa skala fakultas. Pengalaman menarik dari mengikuti kegiatan tersebut, saya menjadi orang yang lebih berkembang salah satunya di bidang marketing. Karena dalam aktivitas yang serba online, promosi merupakan hal yang penting. Selain itu, saya juga belajar untuk bekerja di bawah tekanan. Dan saya juga mengajar privat sederhana, dari situ saya banyak mengenal berbagaimacam karakter anak, selain itu saya juga belajar untuk mengajar sebagai guru online dengan mencari dan membuat berbagaimacan media pembelajaran',	1,	1653574359,	NULL,	0),
('SCHLR-NNY-f54979',	'USR-NNY-ecf559',	'Enny Erawati Situmorang',	'2002-05-11',	'81389397037',	'Jl. Ida Bagus Oka, Gg. Badik No. 11 A, Panjer, Denpasar Selatan, Kota Denpasar, Bali, ID 80224',	'Kesehatan Masyarakat ',	'Universitas Udayana',	'3.64',	'4',	'Nama lengkap saya Enny Erawati Situmorang, saya biasa di panggil Enny. Saya sedang menjalani pendidikan semester 4 di Universitas Udayana, jurusan Kesehatan Masyarakat. Saya seorang mahasiswa dengan semangat yang besar dalam diri saya. Saya juga bertanggung jawab, rajin, dan berdedikasi kualitas yang saya berikan dalam segala hal yang saya lakukan.  Saya juga memiliki pengalaman di beberapa kepanitian di universitas. Dan juga saat ini saya sedang menjalani proses pendidikan semiformal dengan menjadi Peserta Lecture Batch 5 Fisipol UGM X Halodoc (Program Leading Health System Transformation by Simplifying Healthcare).',	'Menjadi ahli epidemiologi yang handal. \r\nCaranya :\r\n1. Tetap konsisten untuk taat dan rendah hati serta mencoba hal-hal yang mustahil dengan \r\n    tetap menikmati prosesnya.\r\n2. Berdoa dan melakukan yang terbaik dalam setiap keputusan yang saya ambil.\r\n3. Memandang masalah sebagai sesuatu hal yang netral dan mengatasi masalah dengan \r\n     respon yang “kreatif” bukan “reaktif”.\r\n4. Lulus kuliah tepat waktu.\r\n5. Bisa mencapai skor Toefl/Ielts target agar bisa mempermudah masuk Beasiswa S2.\r\n6. Mengikuti berbagai kegiatan di internal maupun eksternal universitas untuk mengesah \r\n    kemampuan akademik maupun non-akademik.',	'Saat ini saya sedang tergabung dalam organisasi PAMI BALI (Pergerakan Anggota Muda Pergerakan Anggota Muda IAKMI ((Ikatan Ahli Kesehatan Masyarakat Indonesia). Selain itu saja juga memiliki pengalaman volunteers di @youthnations pada Agustus 2021.',	1,	1654350541,	NULL,	0),
('SCHLR-NNYVL-fdf409',	'USR-NNYVL-d6a79',	'Onny Evaline Gultom',	'2002-02-21',	'81268563344',	'Perumahan Rexvin Village Block B 6, Kelurahan Belian Kecamatan Batam Kota, RT 006 RW 026',	'Pariwisata',	'Universitas Internasional Bata',	'3.75',	'2',	'Saya merupakan anak terakhir dari 4 bersaudara. Kegiatan yang saya lakukan sekarang adalah berkuliah sambil bekerja. saya baru masuk kerja saat bulan Mei 2022 lalu di PT. Cast Lab. Indonesia. Saya menyukai hewan, tapi tidak dengan hewan reptil dan unggas.',	'Mimpi terbesar saya adalah mendapatkan beasiswa Fully Funded di Jepang di tahun 2024/2025 nanti. Saat ini saya sedang mempersiapkan diri dan mental. Saya juga sedang belajar bahasa jepang agar bisa melewati ujian JLPT minimal N3 dan mendapatkan nilai toefl di atas 820 dan IELTS di atas 80. ',	'Saya tidak mempunyai pengalaman organisasi saat SMA karena saya menghabiskan waktu saya untuk merawat Ibu saya. Namun saat baru masuk kuliah saya mengikuti lomba menulis artikel tingkat nasional, tetapi hanya masuk 10 besar saja. Lebih tepatnya di pringkat ke-9',	1,	1654606124,	NULL,	0),
('SCHLR-NPKRS-63f880',	'USR-NPKRS-2f4ff',	'Nopi Krisnawati',	'2002-04-11',	'85692561699',	'Dusun Krajan 2 RT 06 RW 02 Desa Bengle Kecamatan Majalaya Kabupaten Karawang Provinsi Jawa Barat',	'Pendidikan Guru Sekolah Dasar',	'Universitas Pendidikan Indones',	'3.91',	'4',	'Saya Nopi Krisnawati anak ketiga dari empat bersaudara dan merupakan generasi masa depan bangsa Indonesia. Saya lahir di Karawang pada tanggal 11 April 2002 serta memiliki seorang kakak perempuan kembar dengan saya, bernama Nopa Krisdayanti yang sedang menempuh pendidikan di Universitas Buana Perjuangan Karawang. Ayah saya bernama Ace Yepi Cepika yang bekerja sebagai karyawan swasta di salah satu bank tabungan pensiunan nasional di Karawang. Ibu saya bernama Nani Haryani yang bekerja sebagai guru PAUD, didekat rumah. \r\nSebelum masuk sekolah dasar, saya memulai pendidikan nonformal di PAUD selama 1 tahun. Setelah selesai saya bersekolah di SDN Bengle I pada tahun 2008 sampai 2014. Sebuah perjuangan yang tidak sia-sia karena saya mendapatkan peringkat 1 sampai 3 besar setiap kenaikan kelasnya hingga saya mendapatkan kepercayaan sebagai perwakilan sekolah untuk mengikuti Olimpiade IPA. Tak hanya di bidang ke-akademikan, saya tidak lupa untuk mengikuti organisasi di sekolah yaitu Pramuka.\r\n Kemudian saya melanjutkan pendidikan di SMPN 2 Majalaya, pada saat  SMP saya mengikuti organisasi Pramuka karena saya memiliki ketertarikan pada alam dan berlatih kepemimpinan. Dalam menjalankan organisasi Pramuka ada beberapa program kerja yang harus dicapai selama masa jabatan, organisasi Pramuka memiliki program kerja harian, bulanan dan tahunan. Program kerja harian seperti latihan rutin satu kali dalam satu Minggu, program kerja bulanan seperti study banding dengan organisasi Pramuka sekolah lain dan program kerja tahunan seperti mengadakan pelantikan bantara atau laksana serta penerimaan masa tamu ambalan, walaupun saya mengikuti organisasi Pramuka tidak menjadikan suatu hambatan untuk tetap melaksanakan pembelajaran yang menjadikan saya meraih peringkat 1 sampai 3 besar di kelas. \r\nDengan prestasi yang saya raih baik dari akademik maupun organisasi dapat menjadikan saya diterima di SMAN 2 Karawang, di sekolah ini saya menjadi siswi jurusan IPA dengan semangat dan perjuangan yang keras, semua itu tidak menjadikan sebuah kepuasan atas hasil yang saya capai, saya selalu ingin belajar lebih giat lagi. Maka dari itu saya mampu menjadi juara 1 di kelas bahkan menjadi juara umum IPA parallel. \r\nKarena prestasi yang saya raih saya diberikan kepercayaan untuk mengikuti seleksi Olimpiade Sains Kabupaten di SMA yang nanti akan menjadi perwakilan dari sekolah mengikuti di tingkat Kabupaten. Seleksi yang tidak mudah menjadikan saya harus berjuang lebih keras hingga selalu pulang setelah matahari terbenam dengan semua usaha dan doa, saya berhasil mewakili sekolah sebagai siswi yang mengikuti Olimpiade Sains Kabupaten bidang biologi. Dengan mengikuti Olimpiade ini saya berusaha dapat mengerjakannya dengan baik namun keberhasilan menjadi juara belum berpihak yang menjadikan saya harus berjuang kembali nantinya.\r\nPasca lulus SMA, saya bertekad untuk melanjutkan studi di perguruan tinggi. Saya diterima sebagai mahasiswi UPI Kampus Purwakarta dengan prodi PGSD. Pemilihan prodi PGSD dengan alasan saya ingin menciptakan generasi muda dengan tujuan mencerdaskan anak bangsa sejak dini. Prodi PGSD merupakan jurusan kuliah yang serba ada dan serba tahu, dimana saya akan belajar banyak ilmu pengetahuan secara menyeluruh. PGSD tak hanya mengenai teori saja melainkan dapat memahami karakter dan pengembangan kepribadian anak. Perjuangan saya dimulai dari SNMPTN dan diterima melalui jalur tersebut. Walaupun saya diterima jalur tersebut, hal yang saya khawatirkan sampai saat ini yaitu mengenai uang kuliah tunggal. Malu rasanya selalu membebankan orang tua dalam biaya perkuliahan dan dengan cara saya mendaftar beasiswa unggulan saya bisa membantu meringankan beban orang tua saya, bahkan saya bisa membantu orang tua untuk membiayai adik saya. \r\n',	'Saya selalu berpikir bagaimana saya mewujudkan impian itu sendiri. Saya memiliki impian untuk S2 di luar negeri yaitu di Belanda. Sejak semester 1, saya berusaha memulai semua itu dan belajar bahasa Belanda. Tak hanya belajar bahasa, saya mulai mengenal kebudayaan yang ada disana. Saya berusaha semaksimal mungkin untuk selalu dapat mewujudkan impian tersebut.',	'Iya saya mempunyai pengalaman organisasi. \r\n1. Himpunan Mahasiswa PGSD UPI Purwakarta - Ketua Departemen Pendidikan. \r\nHimpunan Mahasiswa PGSD merupakan organisasi yang dibentuk untuk mewadahi mahasiswa PGSD yang berintegritas, kolaboratif, inovatif dan responsif. Dalam 1 periode dapat menjalankan program kerja yang bermanfaat bagi mahasiswa PGSD dan Umum.\r\n2. Infobeasiswa.id - CEO\r\nInfo.beasiswa@id merupakan organisasi yang bertujuan untuk memberikan segala informasi mengenai beasiswa, lomba dan volunteer. Dengan menjadi CEO sudah dapat menjalankan kepengurusan dengan divisi yang telah terstruktur, sistematis dan Fleksibelitas\r\n3. Forum Mahasiswa UPI Karawang - Ketua Departemen Pengembangan Sumber daya Mahasiswa.\r\nForum Mahasiswa Karawang UPI merupakan Komunitas yang didirikan untuk mempermudah komunikasi mahasiswa asal karawang yang berkuliah di UPI. Posisi sebagai Pengembangan sumber daya manusia menjadi acuan dalam menentukan pengelolaan SDM didalamnya. Dengan pengelolaan yang baik dilaksanakan dengan berbagai program kerja dan mendiskusikan segala hal yang berhubungan demi keberlanjutan komunitas ini.\r\n',	1,	1654490941,	NULL,	0),
('SCHLR-NPTDH-3f13ec',	'USR-NPTDH-590f0',	'Ni Putu Dhea Natalie Permata Hati',	'2002-12-25',	'85333423070',	'Jl Imam Bonjol, Gang 100, No. 100J. Denpasar, Bali',	'Komunikasi ',	'Universitas Sebelas Maret',	'3.89',	'4',	'Saya adalah seorang mahasiswa yang mempunyai banyak mimpi dan ambisi. Berangkat dari keinginan untuk terus belajar dan mengupgrade diri, sejak semester satu ketika teman-teman kampus memilih untuk lebih fokus berorganisasi, saya memilih untuk mengambil program internship dengan berbagai role sekaligus mengeksplore diri dengan mencoba hal baru. Dengan berbagai pengalaman profesional di berbagai bidang membuat saya merasa bahwasannya proses belajar itu bisa terjadi dimanapun dan kapanpun, bahkan diluar bangku pendidikan formal. Namun, hal itu juga tidak membuat saya melupakan kewajiban sebagai seorang mahasiswa untuk tetap aktif di bangku kuliah. Selain itu, saya juga merupakan orang yang cukup terbuka dengan berbagai peluang baru, karena hal itu adalah kunci dari proses pembelajaran.',	'Impian terbesar saya saat ini adalah untuk bisa melanjutkan kuliah ke jenjang berikutnya. Bukan di dalam negeri, saya bermimpi untuk bisa melanjutkan pendidikan di Luar Negeri, khususnya di negara Eropa. Hal ini bukan tanpa alasan, saya melihat bahwa saat ini mendapatkan kesempatan untuk mengekspose diri secara global melalui pendidikan adalah peluang yang sangat besar. Selain untuk memperkaya diri dengan ilmu dan pengalaman, hal ini bisa jadi personal branding yang baik. Maka dari itu, untuk mewujudkannya, saat ini saya harus lulus dulu dari tempat saya kuliah saat ini dengan baik, sembari meningkatkan kemampuan berbahasa asing saya. Oleh karena itu, untuk bisa lulus dengan baik tanpa membebankan orang tua, saat ini saya sedang berusaha mencari berbagai opportunity berupa program beasiswa yang bisa saya ambil, salah satunya adalah dengan turut andil dalam program beasiswa YBB Foundation. Kemudian untuk meningktakan skill berbahasa, saat ini saya juga sedang mengikuti kursus berbahasa di salah satu kursus online.',	'Saya cukup aktif mengikui berbagai macam organisasi dan internship dengan berbagai role, diantaranya UKM Radio sebagai Reporter, Himpunan Mahasiswa sebagai seorang Public Relation, dan berbagai programinternship di berbagai startup sebagai PR, Marketing, hingga UX researcher.',	1,	1654136771,	NULL,	0),
('SCHLR-NRHYT-7884dd',	'USR-NRHYT-5922c',	'Nurhayati ',	'2001-11-15',	'81350100991',	'Jalan Gunung Menyapa RT. 34 Tenggarong, Kutai Kartanegara, Kalimantan Timur ',	'Kedokteran',	'Shanxi Medical University ',	'3.20',	'4',	'\r\nSejak kecil saya sangat tertarik dengan hal yang berlandaskan kemanusiaan, seperti kerelawanan dan organisasi, itu juga merupakan salah satu alasan saya ingin mengabdi dan berkontribusi mengabdi pada sesama dan saling membawa kebermanfaatan satu sama lain. Saya sangat suka bersosialisasi, berbaur dan saling berbagi dengan orang banyak, saya merupakan orang yang mudah beradaptasi, menyukai tantangan, dan senang mengembangkan potensi yang saya miliki, maupun belajar hal baru.',	'Menjadi seorang pemimpin yang bijaksana bagi diri sendiri maupun orang lain dan menjadi seorang dokter yang bertanggung jawab terhadap tugasnya. Cara mewujudkannya ialah dengan terus mengasah diri dengan bersungguh sungguh dan belajar dalam hal baik apapun, dimanapun dan kapanpun, karena ada banyak hal baik yang bisa kita pelajari, termasuk kemanusiaan',	'1. Pengurus Pramuka SMP/SMA\r\n2. Wakil Ketua OSIS SMA\r\n3. Staf Divisi Pengabdian dan Kemahasiswaan Perhimpunan Pelajar Indonesia di Tiongkok Cabang Shijiazhuang (PPIT Shijiazhuang)\r\n4. Staf Divisi Operasional Perhimpunan Pelajar Indonesia di Tiongkok Cabang Shijiazhuang (PPIT Shijiazhuang) \r\n5. Sekretaris Perhimpunan Pelajar Indonesia di Tiongkok Ranting Shanxi (PPIT Shanxi) \r\n6. Sekretaris Departemen Pengabdian Masyarakat Perhimpunan Kedokteran Luar Negeri Indonesia (PERLUNI Tiongkok) \r\n7. Staf Komisi Kesehatan Persatuan Pelajar Indonesia di Seluruh Dunia (PPI Dunia) \r\n8. Volunteer Mentoring di Platform pendidikan bimbel persiapan masuk perguruan tinggi gratis, Upgradu\r\n9. Relawan Kesehatan Mental (membantu masyarakat Indonesia yang membutuhkan bantuan terkait kesehatan mental) dengan di bimbingan oleh Dokter yang profesional di bidangnya\r\n10. Volunteer (Koordinator Divisi Kesehatan) NAYS Social Project #4 Ekspedisi Tanah Jawa Chapter Jawa Barat\r\n11. Volunteer (Divisi Kesehatan) Milenial Mengabdi 1.0 Lombok',	1,	1655737225,	NULL,	0),
('SCHLR-NRJNH-423c89',	'USR-NRJNH-e89f0',	'Nurjanah',	'2002-08-17',	'87789038816',	'Cipare ranjeng jaya',	'Manajemen',	'Sekolah tinggi ilmu ekonomi ba',	'3.23',	'2',	'Perkenalkan, saya Nurjanah, Mahasiswa semester 2 sekolah tinggi ilmu ekonomi banten mengambil jurusan Manajemen . Saya pernah mengikuti program pelatihan di bbplk serang,saya cukup baik dalam beronganisasi dan menjalankan suatu acara.',	'Mimpi terbesar saya,saya ingin memberangkatkan orang tua saya haji dan ingin berkeliling dunia memang ini mimpi yang sering di ucapkan orang banyak tapi kenyataan nya memang itulah mimpi terbesar saya..Dan sekarang saya akan berjuang untuk menggapai mimpi saya dengan cara meningkatkan kualitas diri saya contohnya:\r\n•Belajar bahasa inggris,  saya sedang memulai bahasa inggris dari yoitube dan aplikasi,walaupun sedikit terlambat tapi saya akan tetap berusaha\r\n•Banyak membaca pengetahuan baru\r\n•Meningkatkan kemampuan dan keberanian berbicara di depan banyak orang\r\n•Berdoa dan positive thinking, semua pasti akan ada jalannya',	'Saya banyak memiliki pengalan organisai di sma,saya pernah mengikuti organisasi mpk dan menjadi sekretaris di organisasi itu dan tentu itu memberikan banyak pengalaman bagi saya,pahit manis nya sebuah organisasi saya rasakan disitu.',	1,	1654572542,	NULL,	0),
('SCHLR-NRKHL-1338d2',	'USR-NRKHL-b2fbf',	'NUR KHOLIS MAJID ',	'2001-03-05',	'83853977237',	'Dusun kemuning lor - panti - jember - Jawa timur',	'Tadris Bahasa Inggris',	'UIN KHAS JEMBER',	'0.00',	'0',	'Seseorang yang ingin mengembangkan bakat dan prestasi nya ',	'Setelah S1 di Indonesia Ingin bisa kuliah di luar negeri',	'Iya   , yakni sebagai sekretaris, administrasi yang bertugas membuat laporan bulanan sebuah pondok pesantren',	1,	1653972690,	NULL,	0),
('SCHLR-NRLDN-9dd83d',	'USR-NRLDN-b912b',	'Nurul Adinda Lubis',	'2005-05-24',	'81396342198',	'jl. letda Sujono gg jawa no 13',	'ilmu agama ',	'MAN 1 KOTA MEDAN ',	'9.90',	'6',	'saya adalah seorang gadis keturan Jawa dan mandailing yang tinggal di keluarga yang sederhana. saya memiliki kemampuan dalam memasak dan sangat suka untuk travel \r\nsaya berumur 17 tahun saat ini terlahir sebagai anak ke 2 dari 3 bersaudara ',	'menjadi pengusaha besar \r\ncara saya mewujudkan nya adalah usaha keras dengan belajar namun saya juga telah memulai itu dengan mengaplikasikan nya di kehidupan saya seperti berjualan kripik yang saat ini saya lakukan. bahkan saya juga tergabung di Osim sebagai bendahara koordinator bidang wirausaha ',	'ya saya punya. \r\nsalah satunya adalah organisasi siswa intra madrasah (OSIM) dan paskibra saat SMP ',	1,	1655113806,	NULL,	0),
('SCHLR-NRLHD-6fee04',	'USR-NRLHD-eae92',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654409135,	NULL,	0),
('SCHLR-NRLJN-2d70e8',	'USR-NRLJN-d58d6',	'Nurul Jannah',	'2002-08-02',	'87762382002',	'Kebon Nanas Selatan I No.28D, RT 008/RW 008, Kelurahan Cipinang Cempedak, Kecamatan Jatinegara, Jakarta Timur, DKI Jakarta',	'Prodi Matematika',	'Institut Teknologi Sumatera',	'3.34',	'4',	'Eksplorasi adalah cara saya untuk mengembangkan diri dengan mandiri. Keberanian selalu saya utamakan dalam mengutarakan pendapat maupun melakukan suatu kegiatan, sehingga ketakutan tidak lagi berada pada diri saya. Konsisten adalah salah satu motivasi saya agar terus bergerak tanpa\r\nberhenti. Saya adalah mahasiswa Institut Teknologi Sumatera Prodi Matematika. Saya mempunyai prinsip yaitu tetaplah bergerak walaupun sedikit dan janganlah berhenti, itulah hal yang salah satunya menjadi penyemangat untuk saya saat menjadi mahasiswa. \r\n',	'Dari semua mimpi saya, terdapat 4 mimpi yang sangat saya ingin wujudkan. Diantaranya ialah :\r\n1. Menjadi Matematikawan\r\n2. Menjadi Programmer yang Andal\r\n3. Menjadi Komikus\r\n4. Lancar Berbahasa Inggris\r\n\r\nCara saya mewujudkan ke 4 mimpi terbesar saya adalah saya berprogress secara perlahan. Saya mengambil prodi Matematika merupakan langkah awal untuk menggapai mimpi saya nomor 1. Di Prodi Matematika juga diperkenalkan mata kuliah yang bersangkutan dengan bahasa Pemrograman, dan saya sudah mulai mengerti terutama pada bahasa pemrograman yaitu C++, hal ini juga langkah awal saya dalam menggapai mimpi saya nomor 2. Hobi saya adalah menggambar, tentu itu akan sangat membantu untuk merealisasikan mimpi saya nomor 3. Dan saya sangat senang mendengar dan bernyayi lagu berbahasa inggris, dengan begitu saya mengerti sedikit demi sedikit dengan bahasa inggris dimana hal tersebut mendukung saya untuk meraih mimpi nomor 4.',	'Beberapa organisasi telah saya ikuti semenjak duduk dibangku SMP hingga saat ini duduk dibangku Mahasiswa. Semua organisasi yang telah saya membuat saya mendapatkan pengalaman yang tak tergantikan. Sedikit demi sedikit saya menjadi pribadi yang berbeda, seperti awalnya pemalu untuk berbicara di depan hingga sekarang sudah berbicara untuk mengeluarkan pendapat dengan sendirinya. Oleh karena itu, saya pun sangat senang jika di amanahkan sebagai ketua kelompok, ataupun hal yang berbau dengan ketua.',	1,	1655388701,	NULL,	0),
('SCHLR-NRLML-ed7e98',	'USR-NRLML-78b4a',	'Nurul Amalia R',	'2002-10-25',	'81277118994',	'Jalan Semangka, Klakap 7, Dumai,Provinsi Riau',	'Ekonomi Syariah',	'Uin Suska Riau',	'3.73',	'4',	'Saya seorang Mahasiswa semester 4 jurusan Ekonomi Syariah Uin Sulthan Syarif Kasim Riau. Saya merupakan orang yang aktif dan senang bersosialisasi hal ini dapat terlihat dari beberapa organisasi yang saya ikuti. Saya juga merupakan orang yang rajin dan pekerja keras hal ini dapat terlihat pada nilai akademik saya. ',	'mimpi terbesar saya ialah saya ingin Study Abroad di negara impian saya, bagaimana cara saya mewujudkannya ialah saya menerapkan sistem work hard, study hard and pray hard, saya tau tak akan ada hasil jika tak ada yang namanya usaha , oleh karena itu saya akan terus berusaha sekuat tenaga saya untuk bisa meraih impian saya, jika saya gagal saya tak akan menyerah dan akan terus dan terus berusaha kembali',	'berikut ini pengalaman organisasi dan relawan saya:\r\n1. Bangun Pendidikan Indonesia: disini saya sebagai staff dari divisi Youth Development, saya pernah menjadi ketua pelaksana dari event webinar nasional World Mental Health, dan menjadi panitia dari event lainya juga, seperti mentoring dan event volunteering juga\r\n2. 1jam1000mimpi: di sini saya sebagai PIC dari Event team, saya juga beberapa kali berpartisipasi di kegiatan webinar dan acara lainnya\r\n3. Relawan Muda Riau: Ini merupakan organisasi kerelawanan, program yang saya pernah saya ikuti ialah, yang pertama ada nasi ikhlas, sapa sekolah, dapur ikhlas, memberi edukasi kepada anak-anak dan berbagi, mengajarkan ibu-ibu untuk membuat sabu, dan banyak lagi kegiatan lainnya\r\n4. Dema Fakultas : disini saya pernah berpartisipasi menjadi panitia dari event Fasih Expo dan Ekspresi\r\n5. Himpunan Mahasiswa Ekonomi Syariah: disini saya sebagai staff dari divisi Pengembangan Sumber daya Mahasiswa (PSDM) ',	1,	1653484715,	NULL,	0),
('SCHLR-NRLRS-b68b5a',	'USR-NRLRS-b1a9b',	'NURUL RESKY PRATIWI',	'2003-10-19',	'82266869301',	'Jln. Daeng Tata 1 Blok 4F NO.4B, Parang Tambung, Kec. Tamalate, Kota Makassar, Sulawesi Selatan 90223',	'Fakultas Psikologi',	'Universitas Negeri Makassar',	'3.40',	'1',	'Perkenalkan nama saya Nurul Resky Pratiwi saya anak ke empat dari lima bersaudara yang berasal dari keluarga yang memiliki stadar hidup yang baik atau bisa di bilang cukup. Sekarang saya adalah seorang mahasiswi Fakultas Psikologi Universitas Negeri Makassar yang haus akan ilmu, pelatihan dan pembinaan untuk selalu menjaga SDM agar tetap terperbahrui dalam menghadapi era sekarang yang semakin maju. \r\n\r\nAlasan saya ingin bergabung dalam kegiatan ini yaitu  YBB Foundation Scholarship pragram selain sebagai salah satu program beasiswa yang tidak hanya dapat membantu saya dalam segi finansial, tetapi saya juga merupakan  salah satu dari sekian banyak mahasiswa/i yang ingin mengembangkan kemampuan saya melalui pembinaan dan pelatihan yang di berikan dalam YBB Foundation Scholarship pragram ini di mana saya sangat tertarik akan ilmu-ilmu yang di berikan yang tidak di dapatkan dalam proses belajar mengajar secara formal sendiri. meningkatkan Sumber Daya Manusia yang ada dalam diri saya  dan sekitar saya untuk perencanaan tahapan kehidupan selanjutnya melalui  workshop pengembangan soft skill, hinggah mentoring career untuk menjadi insan produktif dan berdaya saing tinggi. \r\n\r\nSaya ingin bergabung dalam kegitan ini juga karena saya merasa YBB Foundation telah memberikan wadah di mana saya dapat mempelajari ilmu baru dan mengembangkan kemampuan yang saya miliki, dan saya yakin dalam event ini bukan hanya wadah bagi orang yang mempunyai kemampuan tetapi juga sebagai wadah bagi kami Mahasiswa/i yang memiliki keinginan dan tekat untuk maju dan berkembang.',	'Semua orang berhak bermimpi setinggi mungkin dan meciptakan cara-cara untuk mencapai mimpinya masing-masing. Saya percaya bahwa tanpa mimpi orang-orang akan kehilangan gairah hidup karena tidak memiliki dorongan untuk maju dan hidup tanpa mimpi tidak akan berarti dan bermakna mendalam.\r\n\r\nSaya mempunyai mimpi besar dalam hidup saya yaitu sangat ingin mempunyai suatu yayasan yang bergerak di bidang sosial dan pendidikan di mana saya dapat membuka mitra besar yang dapat membawa perubahan bagi lingkungan sekitar saya bahkan saya bermimpi hingga dapat membuka dalam lingkup nasional hingga internasional. Di mana landasan mimpi saya sendiri ini di dasarkan pada masalah pendidikan, sosial, hingga perekonomian yang selalu membuat saya selalu berpikir di tengah gelapnya malam apakah saya dapat menjadi seseorang yang dapat merubah hidup orang-orang di luar sana, yang dapat membuka lowongan pekerjaan, memberikan mutu pendidikan bagi generasi bangsa yang baik, hingga bantuan sosial karna saya percaya di setiap sisi dunia juga pasti memiliki keberagaman yang sudah menjadi takdir dunia yang dapat di jadikan setiap detiknya menjadi sebuah pembelajaran.\r\n\r\nNah dari mimpi-mimpi saya ini saya selalu ingin menemukan cara-cara baru di setiap hari saya agar kiranya sedikit demi sedikit akan selalu ada perubahan baik entah dalam diri saya sendiri ataupun bagi orang di sekitar saya. salah satu cara yang saya lakukan yaitu selalu menghargai waktu, di setiap hari saya percaya dengan menghargai waktu dalam artian saya dapat memeluk hidup saya sendiri mulai dengan mengatur jadwal kegiatan hingga ibadah saya terhadap Tuhan. saya juga selalu ingin menambah relasi hubungan dengan berkenalan dan berteman dengan banyak kalangan mulai dari teman kampus, masyarakat hingga orang-orang yang mempunyai kedudukan, saya dapat belajar dari mereka tentang bagaimana cara memaknai hidup. menentukan Goals saya, selalu menerapkan konsistesial, selalu memberikan reward kepada diri sendiri di setiap keberhasilan yang saya capai sekecil apapun itu, hinggah meninjau strategi-strategi kemajuan termasuk dengan bergabung dalam program ini yang akan memberi ilmu dan pengatuan baru bagi saya.',	'Ketua Umum Palang Merah Remaja Unit 001 SMAN 1 Luwu Periode 2020-2021\r\nMemimpin dan mengkoordinir berjalannya organisasi sesuai dengan AD/ART organisasi. Membantu Sekretaris mempersiapkan dan menyampaikan laporan pertanggung jawaban kepengurusan ke PMI cabang Kab.Luwu.\r\n\r\nAnggota Paskibraka Kab.Luwu Tahun 2019\r\nBerpartisipasi dan mengamalkan bela negara dengan bergabung dalam Pasukan Pengibar Bendera Pusaka Kab.Luwu pada 17 Agustus 2019\r\n\r\nMenjadi Ketua TIM Olimpiade Sains Nasional Kab.Luwu\r\nBidang Georafi Tahun 2020\r\nBidang geografi adalah salah satu bidang keilmuan sosial yang mengkaji tentang segala aktivitas manusiadan alam mulai dari masalah sosial hinggah ekonomi, serta interaksi di antar keduanya melalui perspektif ruang hinggah terbentuk pola ruang tertentu yaitu bumi.\r\n\r\nMenjadi anggota Training Center ke 12  BKM Psysport Fakultas Psikologi UNM\r\nBKM psysport sendiri memberikan perhatian khusus pada bidang psikologi olahraga. psikis seorang atlit, pelatih, hinggah orang orang yang andil dalam sebuah keolahragaan akan di perhatikan psikologisnya.\r\n\r\nDalam bidang relawan sendiri saya selalu punya semangat untuk selalu membantu dalam bidang sosial sebagai sukarelawan salah satunya dalam bencana banjir bandang di kabupaten Luwu Utara tepatnya di Masamba yang menghantam satu kabupaten habis tenggelam dalam banjir bandang yang bercampur lumpur  tersebut di tahun periode saya menjadi Ketua Palang Merah Remaja tahun 2020 saya memimpin pemberian bantuan sandang, pangan, hinggah papan (tempat tinggal) bagi korban bencana di sana. mengikuti perkembangan rehabilitasi bencana masyarakat.',	1,	1655001064,	NULL,	0),
('SCHLR-NRLYC-d0c72b',	'USR-NRLYC-7e597',	'Nur Auliya\' Choirunnisa\'',	'2002-12-28',	'83127494324',	'Belakan, RT 1 RW 1 Siswodipuran Boyolali, Boyolali Jawa Tengah ',	'PKK/Pendidikan Tata Boga/Tekni',	'Universitas Negeri Semarang ',	'3.59',	'2',	'Perkenalkan saya Nur Auliya\'Choirunnisa\', yang biasa dipanggil dengan Auliya lahir di Boyolali, 28 Desember 2002. Saya tinggal di sebuah kampung bernama kampung Belakan. Hobi saya yang rutin saya lakukan adalah memasak karena sesuai dengan jurusan kuliah saya.\r\n\r\nTentang Keluarga ',	'Impian terbesar saya ingin membuat orang tua saya bahagia, bangga memiliki anak seperti saya. Cara saya untuk mewujudkannya dengan meringankan beban orang tua saya, saya harus sukses dan membahagiakan orang tua saya.',	'Ya, saya mempunyai pengalaman organisasi diwaktu SMK. Saya mengikuti organisasi rohis. ',	1,	1653532498,	NULL,	0),
('SCHLR-NRLZZ-735d52',	'USR-NRLZZ-29d00',	'Nurul Izzah',	'2002-02-07',	'895700656927',	'Jl. Swadaya, Pringsewu utara Pringsewu Lampung',	'Pendidikan Bahasa Inggris',	'Universitas Raden Intan Lampun',	'3.52',	'2',	'Saya termasuk orang yang terkadang mudah bergaul tetapi kadang sulit bergaul, saya selalu mencoba untuk dapat berbicara didepan umum, karena saya merasa Public speaking saya kurang.',	'Menjadi mahir berbahasa dan dapat membagi ilmu yang saya miliki apda orang lain, dengan cara mengambil pendidikan bahasa Inggris',	'Tidak',	1,	1653556651,	NULL,	0),
('SCHLR-NRNQL-8f585b',	'USR-NRNQL-e5e63',	'NURAINI AQILAH',	'2004-12-28',	'82260289980',	'Jln.marindal 1 pasar Vlll',	'MIPA',	'MAN 3 MEDAN',	'0',	'0',	'Saya adalah seorang anak biasa yg bertekat untuk kuliah tapi tidak ingin terlalu membebani keluarga .',	'Mimpi terbesar saya adalah ingin melihat senyuman bahagia orang-orang yg berada di dekat saya khususnya, dan salah satu cara saya untuk mewujudkannya dengan menjadi dokter,karena menurut saya kesehatan kunci utama kebahagiaan. ',	'Saya belum mengalaminya namun saya menginginkannya',	1,	1655481154,	NULL,	0),
('SCHLR-NRRHM-7254fe',	'USR-NRRHM-21ce4',	'Nur Rohim Toyib Prasetyo',	'2003-04-06',	'81242160064',	'Masjid Al Muklis, Jalan Maccini Raya No. 169, RT2/RW.2, Sinri Jala Panakkukang, Kota Makassar, Sulawesi Selatan, ID 90232',	'Pendidikan Teknik Elektro',	'Universitas Negeri Makassar ',	'3.30',	'2',	'Saya adalah Mahasiswa Fakultas Teknik dari Universitas Negeri Makassar yang sedang menginjak jenjang semester 2 yang sementara ini akan naik semester 3. saya sering belajar secara Wicked Learning Environtment sehingga bisa dibilang multitalent dan punya ambisi tinggi.',	'mimpi terbesar saya adalah membanggakan kedua orang tua saya dan cara saya mewujudkannya yaitu mewujudkan keinginannya yaitu anaknya bisa jadi anak yang sukses, berilmu dan bermoral. maka dari itu saya ingin lulus kuliat secara cepat dan tepat waktu, tepat dicumalude dan tepat di periode. ',	'pengalaman organisasi saya yaitu ikut organisasi pramuka dan adapun organisasi saya itu telah memenangkan banyak penghargaan dan sering di undang di gedung walikota dalam melaksanakan upacara dan hari-hari peringatan',	1,	1654932690,	NULL,	0),
('SCHLR-NRSRY-0fc145',	'USR-NRSRY-5d9c5',	'Narasurya Ray Pasad',	'2003-05-06',	'82223338281',	'Provinsi Jawa Tengah,Kabupaten Jepara,Kecamatan Bangsri,dusun Banjaragung,Rt 07 Rw 04',	'IPA',	'SMA 1 Bangsri',	'3.20',	'6',	'Nama saya Narasurya Ray Pasad. Lulusan dari SMA Negeri 1 Bangsrsi tahun 2019/2022 pada jurusan IPA. Selama menempuh sekolah, saya aktif di kegiatan organiasi di dalam maupun luar sekolah.\r\n\r\nSebagai perwakilan untuk tingkat sekolah, saya aktif memberikan kontribusi dengan mengikuti perlombaan dan aktif mengikuti organisasi di sekolah seperti OSIS,Pramuka dan PMR. selain itu saua juga ikut kegiatan diluar sekolkah seperti Forum Anak,Duta GenRe, dan Duta Wisata. Pengalaman tersebut membantu saya dalam memanage waktu antara tugas sekolah dan aktifitas saya yang lain.\r\n\r\nSaya merupakan anak pertama dari 4 bersaudara. Ibu saya tidak bekerja. maka dari itu,saat saya melihat info mengenai beasiswa ini di media sosial,saya ingin meringan beban mereka dengan melamar di Beasiswa YBB Foundation ini. Saya harap bapak/ibu mau memilih saya sebagai salah satu penerima Beasiswa Youth Break the Boundaries.',	'Impian saya yaitu,ingin memiliki usaha sendiri di bidang desain dan teknologi, menjadi desainer yang berpengalaman di dalam dan luar negeri, dan juga pengen bikin produk digital sendiri\r\n\r\nsaya sadar bahwa\r\n-Memiliki usaha sendiri di bidang desain & teknologi berarti harus: belajar bisnis, negosiasi, komunikasi, desain, programming, dll.\r\n-Menjadi desainer di dalam dan luar negeri. berarti harus: belajar desain, cari pengalaman kerja di bidang desain, dan juga menguasai bahasa Inggris (atau bahasa lain).\r\n-Membuat produk digital\r\nBerarti harus: belajar proses membuat produk digital, belajar programming, dan juga cara memasarkan produk.\r\n\r\nUntuk 5 tahun lagi,saya harus menguasai skill desain, bisnis, dan minimal udah bisa bikin website sendiri. Sebaiknya, 5 tahun lagi, bisnis nya sudah mulai jalan — sambil kerja jadi desainer di luar negeri. Semoga udah ketemu jodoh dan udah menikah juga\r\n\r\nUntuk 3 tahun ke depan. Untuk menguasai skill desain, bisnis, dan programming,gaya harus:\r\n-Belajar Desain\r\n-Belajar Bisnis\r\n-Belajar Programming\r\n\r\nKarena saya masih pelajar/mahasiswa, saya sebisa mungkin menyediakan waktu untuk belajar ilmu baru dan konsisten melakukan itu. Untuk mencapai itu,saya buat Target Bulanan dan meriview Target Bulanan saya.',	'- Juara 3 Lomba Duta Wisata Kabupaten Jepara 2021\r\n- Juara Harapan 1 Duta GenRe kabupaten Jepara 2021\r\n- Ketua seksi bidang 3 OSIS SMA Negeri 1 Bangsri 2019-2020\r\n-Ketua seksi bidang Divisi Dokumentasi Pramuka PMR SMA Negeri 1 Bangsri 2019-2020\r\n- Anggota Forum Anak Kabupaten Jepara dengan masa jabatan 2019-2021.\r\n- Anggota Forum Anak Jawa Tengan dengan masa jabatan 2020-2022\r\n- Ketua Panitia Konferensi Forum Anak Jawa Tengah\"Muda Berdaya 2021\" yang\r\ndiselenggarakan 28-29 Oktober 2021\r\n- Relawan Pecinta Alam kabupaten Jepara 2019-2021',	1,	1654514427,	NULL,	0),
('SCHLR-NRTSL-8e846c',	'USR-NRTSL-cf522',	'Nur Atsilah MFP ',	'2001-08-01',	'831348048047',	'Dsn Muncar Baru Desa Tembokrejo RT/RW 003/007 Kec. Muncar Kab. Banyuwangi ',	'Tadris Bahasa Inggris ',	'UIN KHAS JEMBER ',	'3.65',	'4',	'Saya mahasiswa pendidikan bahasa Inggris. Saya anak kedua dari 4 bersaudara. Ibu bekerja sebagai wirausaha dan ayah buruh kerja di TPI Muncar. Mimpi terbesar saya adalah menjadi pendidik yang baik dan translator buku atau komik yang berbahan Inggris ',	'Menjadi pendidik yang baik dan bisa menyebarkan literasi negara-negara lain ke Indonesia. Langkah awal saya mewujudkan nya dengan cara mengikuti event ini pengembangan diri baik online atau offline dan dapat dipraktekkan dalam masyarakat sekitar ',	'Pernah menjadi keanggotaan OSIS MAN 3 BANYUWANGI\r\nPernah menjadi keanggotaan DEWAN AMBALAN MAN 3 BANYUWANGI\r\nPernah menjadi keanggotaan Extra Kulikuler Teater MAN 3 BANYUWANGI\r\nAktif dalam organisasi sama masyarakat yakni remaja masjid\r\nPernah menjadi MC dalam beberapa acara pengajian dan formal dalam perlombaan ',	1,	1654320431,	NULL,	0),
('SCHLR-NRWKH-3b208e',	'USR-NRWKH-00e8e',	'Nuria Wakhidatul Istiqomah ',	'2002-08-18',	'81913408184',	'Jl. Rambutan Pesanggarahan selatan, Pasuruan, Jawa Timur',	'Teknik Mesin',	'Universitas Negeri Malang',	'3.59',	'2',	'Saya adalah Mahasiswa Semester dua Teknik Mesin yang memiliki kemauan untuk mempelajari dan mendalami hal hal baru. Saya merupakan individu yang memiliki antusias yang tinggi, dan memiliki kemampuan komunikasi yang baik',	'Mimpi terbesar saya adalah menjadi seorang wanita karir yang mempunyai suatu perusahaan sendiri, dan upaya saya untuk mewujudkannya adalah dengan menempuh kuliah sebagai dasar ilmu yang dimiliki dan terus memperbanyak pengalaman dengan mengikuti organisasi di dalam kampus. ',	'Iya, saya mempunyai pengalaman organisasi saat itu saya menjadi anggota suatau himpunan di jurusan saya, dan ikut serta dalam acara Donor darah yang diadakan oleh Himpunan, pada acara tersebut saya bertugas sebagai membuat template sertikat peserta yang berpastisipasi sebagai pendonor darah saat itu. ',	1,	1654749987,	NULL,	0),
('SCHLR-NRYFZ-c81328',	'USR-NRYFZ-d8738',	'Nur Ayufauziyah',	'2004-06-11',	'89509141800',	'Jl. Pangeran Antasari No.33 RT.13 Gang Pertemuan',	'Jurusan Matematika Prodi Pendi',	'Universitas Negeri Malang',	'0.00',	'1',	'Lulus dari SMA Negeri 2 Balikpapan yang berkesempatan menjadi mahasiswi program studi pendidikan matematika jalur SNMPTN dengan nilai rata-rata semester akhir mencapai 92,3 di universitas terbaik pertama untuk kategori pendidikan, Universitas Negeri Malang. Kuliah pendidikan sudah menjadi impian sejak memutuskan untuk mengajar bimbel online semenjak kelas 1 SMA semester genap perihal mengisi waktu luang saat pandemi. Awal mula berkarir lewat twitter sebagai pengajar bimbel matematika untuk jenjang SD sampai SMA. Bisnis berkembang menjadi jasa tulis, jasa pembuatan power point dengan template sederhana, jasa ketik microsoft word, hingga desain poster dan infografis. Sempat membuka grup order merchandise impor seperti album Korea dan lain-lain, salah satu pengalaman yang membuat saya belajar bahasa Inggris tanpa sadar saat bernegoisasi dengan penjual diluar negeri. Namun, semenjak menuju kelulusan, beberapa kegiatan mulai ditiggalkan, salah satunya menutup grup order, menutup orderan jasa desain, bisa dikatakan menutup keseluruhan bisnis kecuali mengajar. Hingga Allah beri kesenjangan waktu mulai 29 Maret saya dikatakan lolos jalur SNMPTN, jalur impian. Semenjak saat itu, kegiatan bisnis mulai saya jalani kembali. Hingga kini, di hari saya mendaftar, saya masih aktif mengajar bahkan menambahkan jumlah mata pelajaran menjadi; Matematika, Fisika, dan Kimia untuk jenjang SD-SMA.\r\n\r\nDisamping akademis, saya sangat suka dengan makeup, hampir setiap keluar rumah tidak lepas dengan alat makup. Tertarik semenjak SD, saya akui keinginan belajar makeup timbul alami ketika melihat orang lain mampu merias wajah menjadi lebih indah. Semenjak SMA mulai benar-benar memperdalam skill makeup, menonton tutorial youtube, dll. Selain itu, saya suka bermain musik, walau tidak menjadi kegiatan prioritas, saya belajar keyboard semenjak SMP, selain itu suka bernyanyi. Mengikuti paduan suara semenjak SD dan mulai mengikuti lomba semenjak SMP hingga menjadi pengurus di Paduan Suara SMA Negeri 2 Balikpapan',	'Terkadang seorang sarjana pendidikan dipandang sebelah mata sebelum ia menjadi  Pegawai Negeri Sipil, bahkan sebelum saya benar-benar menempuh kehidupan perkuliahan saya, sudah mendapat beberapa pertanyaan yang mengarah ke, \"Kenapa harus pendidikan? Lulus jadi honorer kan\". Stigma yang masih banyak melekat, salah satu tekad saya untuk membuktikan. Seorang guru tidak hanya perkara penghasilan, tapi bagaimana ia mampu menebar amal, ilmu bermanfaat, betapa kemuliaan terus mengalir untuk seorang guru. Sebagai pengajar bimbel, saya merasakan suatu kesenangan yang mutlak saat murid yang mempercayai saya sumringah ketika, \"Kak, terimakasih yaa aku jadi ngerti materinya.\" Bukti bahwa saya berhasil, impian saya selaku seorang pengajar, bagaimana saya bisa membantu sebanyak-banyaknya. Saya ingin memiliki bimbel online yang relasinya sangat luas, banyak dikenal, berkaca pada teknologi saat ini serba mudah. Saya juga punya impian menjadi seorang pembuat konten entah edukasi, vlog, tutorial makeup, atau bermain musik.\r\n\r\nSalah satu usaha saya dibalik mimpi saya yang bertubi-tubi. Saya resmi memperbesar relasi bimbel online sebagai perayaan ulang tahun saya 11 Juni kemarin, yang mulanya hanya via twitter dan telegram menjadi akun instagram, selain itu resmi memiliki nama khusus bimbel online yaitu Idilenya College. Bahasa Amharik mengartikan Idilenya sebagai beruntung, sesuai nama belakang saya, Fauziyah dalam bahasa Arab artinya beruntung. Semoga keberuntungan selalu menyertai segala impian saya. \r\n\r\nHasil bisnis tadi banyak digunakan untuk kebutuhan pribadi contohnya HP, dan laptop. Selain itu banyak digunakan untuk alat makeup, seperti yang sudah saya sebutkan saya sangat memimpikan menjadi Make Up Artist (MUA), atau membuka kelas dan membuat video tutorial makeup. Hampir setiap hari saya makeup, meningkatkan skill secara otodidak belajar banyak lewat platform gratis yang sudah tidak sulit untuk kita akses, punya renaca untuk membuat konten makeup nantinya. Saya belajar mengedit video dengan fitur sederhana entah bagaimana caranya agar orang dapat menikmati video yang saya buat.',	'Organisasi pertama saya ialah OSIS sebagai ketua seksi bidang komunikasi bahasa asing saat SMP, disamping itu mengikuti ekstrakulikuler paduan suara, Palang Merah Remaja dan aktif mengikuti perlombaan dan kegiatan sekolah. Saat SMA memutuskan untuk tidak mengikuti OSIS, bermaksud untuk fokus sebagai pejuang olimpiade dan urusan akademis lain.\r\n\r\nAwal mula tidak sengaja menjadi relawan saat kelas 1 SMA saya ditunjuk untuk mengajar teman-teman saya untuk persiapan olimpiade karena guru kami sedang berhalangan, kami saling membantu hingga kelas 2 SMA saya bersama kedua teman saya membangun perkumpulan pejuang olimpiade matematika di sekolah yang lebih terstruktur dan kami beri nama Komunitas Pecinta Matematika (@kpm.ath on Instagram) menjadikan saya sebagai wakil ketua pertama di komunitas tersebut, dan kami serahkan pengabdian kami kepada adik-adik kelas kami dan begitupun seterusnya. Sampai mengikuti Kompetisi Sains Nasional tahunan untuk mata pelajaran matematika dimana hanya tiga peserta terpilih dari sekian banyak kandidat. Ditunjuk untuk mengikuti Lomba Debat Nasional Indonesia tahun 2020, lomba debat pertama saya tanpa tim, lomba debat pertama yang dilaksanakan secara online mengingat saat itu terhalang pandemi. Olimpiade pertama saya pada tingkat kota yang diadakan Universitas Balikpapan tahun 2019 menjadikan saya finalis, namun belum mampu menjadi juaranya. Pencapaian lain ialah menjadi Semifinalis Olimpiade Matematika tingkat provinsi Kalimantan Timur yang diadakan oleh Universitas Mulawarman tahun 2021, lingkungan sekolah yang kurang apresiasif dan support, menjadikan kami sebagai pejuang olimpiade memilki pencapaian yang minim, namun kami tetap bangga. \r\n\r\nSaya sempat membuka kelas gratis dengan total 50 orang, bergerak menjadi relawan mandiri selama sebulan dengan total 16 jam atau 8 pertemuan untuk membahas soal UTBK. Sebelum SNMPTN, saya giat belajar mempersiapkan UTBK semenjak kelas 2 SMA, menabung dari hasil mengajar untuk membeli buku penunjang, total buku di tangan saya saat itu mencapai 21 buku khusus persiapan saya. Ternyata buku-buku tersebut bukan untuk saya berjuang UTBK melainkan untuk teman-teman lain yang perlu dengan saya sebagai perantara. Berbekal buku yang saya punya, saya turut belajar, merasakan perjuangan saya bersama pejuang UTBK yang lain. Setelah selesai, menjelang UTBK saya buka promo khusus persiapan UTBK dari harga asli turun puluhan persen hingga menjadi harga 10 ribu perjamnya, dengan fasilitas dan sistem belajar yang tidak berubah.',	1,	1655204952,	NULL,	0),
('SCHLR-NRZZH-37a16a',	'USR-NRZZH-807ae',	'Nur Azizah Fitri',	'2002-12-16',	'82312612199',	'Jl. Paus Gang Lumba-Lumba, Pekanbaru, Riau',	'Farmasi',	'Universitas Andalas',	'3.63',	'1',	'Assalamualaikum wr wb, perkenalkan nama saya Nur Azizah Fitri\r\nSaya anak ketiga dari 5 bersaudara.\r\nPada tahun 2012, ayah kandung saya meninggal dunia.\r\nSejak saat itu, saya dan keluarga saya hidup serba berkecukupan dengan penghasilan dari usaha Alm. ayah saya yang tidak seberapa.\r\n\r\nDitambah lagi saat masa pandemi covid 19 yang melanda Indonesia beberapa waktu yg lalu, peninggalan usaha Alm. ayah saya mengalami kebangkrutan.\r\nSekarang kami hanya mengandalkan penghasilan dari ayah sambung  yang berprofesi sebagai securiti di Car Wash dan Salon Mobil yang harus menghidupi 5 orang anak yang mayoritas masih duduk di bangku sekolah.\r\n\r\nDi bangku sekolah, saya selalu menjadi juara kelas dan mendapatkan nilai yang cukup memuaskan. Oleh karena itu, sejak SD sampai SMA saya termasuk salah satu alumni di sekolah - sekolah negeri favorit di kota saya.\r\n\r\nBeranjak di masa sekarang, alhamdulillah saya lolos SBMPTN dan berkuliah di Universitas Andalas Fakultas Farmasi semester 2.\r\nLantas mengapa saya memilih jurusan farmasi diantara jurusan terbaik lainnya?\r\nHal itu dikarenakan impian dan hobi saya di masa kecil.\r\nSejak kecil saya bercita - cita ingin membuka klinik kecantikan kulit.\r\nBerawal dari hobi saya yang suka membaca kandungan serta komposisi yang tertera di belakang kemasan obat dan  produk perawatan wajah, saya  tertarik  untuk mencari di internet apa saja sih manfaat kandungan tersebut.\r\n\r\nImpian dan cita - cita saya tersebut tidak lepas dari dukungan orang tua dan ridha dari Yang Maha Esa.',	'Mimpi terbesar di hidup saya yaitu ingin membuka klinik kecantikan dan kulit.\r\nBerawal dari hobi saya yang suka membaca kandungan serta komposisi yang tertera di belakang kemasan obat dan  produk perawatan wajah, saya  tertarik  untuk mencari di internet apa saja sih manfaat kandungan tersebut.\r\n\r\nLangkah awal untuk mewujudkan mimpi tersebut yaitu  dengan cara saya yang semakin semangat mencari informasi di berbagai media dan mulai bergabung dalam organisasi yang berhubungan dengan kesehatan dan kecantikan.\r\nSeperti, organisasi Palang Merah Remaja (PMR)\r\ndan saya dipercaya menjadi ketua nya.\r\nSelain itu, saya juga bergabung di organisasi masyarakat Pekanbaru Beauty Blogger (PKUBB).\r\nDi organisasi  tersebut, saya termasuk salah satu anggota yang paling muda.\r\nDi sana saya juga banyak berkenalan dengan sesama anggota, saling berbagi ilmu, diajarkan cara menulis dan membuat blog, dan juga mengadakan kegiatan sosial dan event menarik lainnya khususnya di wilayah Kota Pekanbaru.\r\n\r\nTidak hanya itu, saya senang dan hobi menonton video - video dokter kulit dan dokter kecantikan untuk menambah wawasan.\r\nBanyak diantara teman - teman dan saudara saya tak jarang meremehkan  dan bertanya, mengapa saya bermimpi untuk membuka klinik kulit dan kecantikan? Apakah tidak terlalu tinggi  bermimpi menjadi seorang apoteker handal padahal kamu anak dari keluarga yang hidup serba berkecukupan ini?\r\n\r\nWalaupun sering ditanyakan pertanyaan seperti itu, tetapi tidak menyurutkan tekad dan semangat saya untuk mencapai mimpi saya tersebut.\r\nSeperti yang saya ceritakan sebelumnya, saya memiliki rasa ketertarikan yang tinggi terhadap kandungan skincare, terutama perawatan wajah dan kulit.\r\nImpian kedepannya adalah saya ingin membuka klinik kulit kecantikan dan mempekerjakan beberapa dokter spesialis kulit handal dengan saya sendiri sebagai seorang apotekernya.\r\n\r\n Melihat permasalahan wanita di Indonesia, rata-rata permasalahan wanita di Indonesia tidak luput dari permasalahan kulit terutama kulit wajah. Seperti: jerawat, bopeng, blackheads, whiteheads, bruntusan, sunburn, flek hitam dll.\r\nHal ini sering kali menyebabkan munculnya rasa tidak percaya diri  dan rasa tidak puas pada wanita yang mengalami permasalahan tersebut.\r\nApakah rasa percaya diri dibutuhkan dan berpengaruh untuk hidup seseorang?\r\nJawabannya tentu saja berpengaruh.\r\nMemang, terkadang kita sebagai wanita perlu melihat dan mencontoh wanita lain di luar sana yang dapat membawa dampak positif dalam diri kita.\r\nTetapi, bukan malah membuat kita membandingkan diri dengan wanita lain dan kita merasa rendah diri olehnya.\r\n\r\nDengan demikian, sudah jelas bahwa tidak adanya rasa percaya diri dalam diri seorang wanita, akan membuat seorang wanita tsb merasa dirinya rendah, mengalami takut berlebih, sering mengurung diri, dan tidak berani berinteraksi dengan lingkungan sekitar.\r\nSehingga semua hal itu dapat mempengaruhi kondisi mental dan daya produktif kita sebagai seorang perempuan.\r\n\r\n Mungkin bagi mereka yang mempunyai rezeki berlebih itu bukan masalah yang besar, mereka bisa dengan mudah ke dokter kulit dan mengatasi permasalahan kulitnya tersebut.\r\nTetapi bagi mereka yang untuk memenuhi kebutuhan sehari - hari saja pas - pas an bagaimana mereka bisa mengatasi permasalahan kulit mereka tersebut? \r\n\r\nInsya Allah, jika mimpi saya untuk membuka klinik kulit dan kecantikan dapat terwujud, saya akan menolong mereka dengan kondisi ekonomi yang pas-pasan dan serba berkecukupan untuk mengatasi permasalahan kulit mereka sehingga mereka tidak akan merasa kurang percaya diri lagi.\r\nMenolong yang saya maksud  misalnya, \r\nmemberi potongan harga hingga membayar seikhlasnya bagi mereka yang memang terkendala dalam hal ekonomi.\r\nSehingga mereka tidak perlu merasa “insecure” lagi bila melihat dan bertemu wanita lain yang mereka anggap fisiknya lebih baik dari mereka sendiri.\r\n\r\nKemudian untuk mewujudkan itu semua, langkah selanjutnya yang bisa saya lakukan sebagai anak bangsa adalah saya akan semakin semangat dan giat belajar serta mencari informasi dari semua media yang ada. Serta saya akan bergabung dengan organisasi baru yang sesuai dengan hobi saya yaitu mempelajari dunia kesehatan, dan menulis yang nantinya saya berharap dengan saya aktif mengikuti kegiatan di dalam organisasi tersebut, saya akan semakin banyak mempunyai teman yang otomatis ilmu dan informasi yang saya dapat juga semakin banyak pula. Lalu menghantarkan saya untuk semakin dekat dalam mewujudkan cita - cita saya untuk membuka klinik kulit dan kecantikan.\r\n     Tak lupa pula, ilmu yang saya dapatkan selama di dunia perkuliahan ini akan saya gunakan sebaik mungkin. Jika ada rezeki dari Allah, saya akan langsung melanjutkan pendidikan ke jenjang S-2. Tetapi jika belum ada rezeki, saya akan melamar dan bekerja di rumah sakit serta instansi kesehatan lainnya, dengan berbekalkan ilmu yang sudah saya dapatkan selama di dunia perkuliahan tersebut. Sembari mencari informasi beasiswa dan menabung sedikit demi sedikit untuk bisa melanjutkan kuliah di jenjang S-2. Lalu, saya akan membuka klinik kulit kecantikan dan mempekerjakan beberapa dokter spesialis kulit handal dengan saya sendiri sebagai seorang apotekernya.\r\n \r\nSemoga mimpi saya dapat terwujud, Aamiin',	'Dibawah ini adalah pengalaman saat saya mengikuti organisasi:\r\n\r\nA. Sekolah Dasar (SD)\r\nAwal mula saya terjun ke dalam sebuah organisasi adalah semasa SD.\r\nTidak banyak organisasi yang dapat diikuti saat itu.\r\nSaat SD, saya mencoba mengikuti organisasi Pramuka.\r\nBanyak hal yang dapat saya peroleh dari mengikuti organisasi tersebut.\r\nMulai dari belajar meningkatkan kepercayaan diri di depan publik, cara berkomunikasi dan berinteraksi dengan sesama, hingga memiliki banyak kenalan dengan teman sekolah.\r\nPengalaman yang paling berkesan saat mengikuti organisasi tersebut adalah saat  saya bersama tim mendapat juara 2 ketika diutus untuk mewakili sekolah dalam perlombaan Pramuka Siaga antar sekolah.\r\n\r\nB. Sekolah Menengah Pertama (SMP)\r\nBeranjak ke masa SMP, di masa ini saya mulai banyak mengikuti kegiatan - kegiatan ekstrakurikuler di luar jam pelajaran sekolah.\r\nOrganisasi yang pertama saya ikuti adalah organisasi Palang Merah Remaja (PMR) Madya SMPN 4 Pekanbaru.\r\nAlasan saya bergabung dalam PMR sama seperti yang sudah saya katakan sebelumnya.\r\nSaya sangat tertarik pada dunia kesehatan, saya hobi mencari tahu apa saja manfaat dan kandungan yang tertera di balik kemasan obat dan perawatan wajah. \r\nAlhamdulillah, di organisasi tersebut saya dipercaya untuk menjadi ketua organisasi, dan bertugas sebagai pemimpin berjalannya organisasi dengan lancar.\r\nBanyak pengalaman seru dan menarik yang tidak terlupakan.\r\nKami sering mengharumkan nama sekolah dengan memenangkan berbagai jenis perlombaan dari mulai tingkat sekolah, kota, bahkan tingkat provinsi.\r\n  \r\n       Kemudian, organisasi yang saya ikuti selanjutnya adalah eskul matematika.\r\nJika banyak orang yang membenci dan mengatakan bahwa pelajaran hitungan sangat membosankan, saya terkecuali di dalamnya.\r\nSejak kecil saya sangat menyukai pelajaran matematika.\r\nMenurut saya, sangat mengasyikkan berkutat dan menghabiskan waktu untuk mengerjakan soal matematika. \r\nMungkin itu pula lah yang membuat nilai Ujian Nasional (UN) saya sedikit lebih tinggi daripada teman - teman yang lain, sehingga saya bisa menjadi salah satu siswa di Sekolah Menengah Pertama Negeri 4 Pekanbaru yang notabene nya adalah salah satu sekolah favorit di Provinsi Riau.\r\nSaat mengikuti eskul ini, beberapa kali saya pernah mengikuti Olimpiade Matematika.\r\nTetapi karena tanggung jawab saya lebih sering tercurahkan kepada organisasi PMR, akhirnya saat kelas 9 saya memutuskan untuk keluar dari organisasi ini.\r\n\r\nC. Sekolah Menengah Atas\r\nSaat sekolah menengah atas ada beberapa eskul yang saya ikuti. Mulai dari yang akademik sampai yang non akademik.\r\nOrganisasi pertama yang saya ikuti adalah Palang Merah Remaja (PMR)\r\nSama seperti saat SMP, organisasi yang satu ini juga memberikan banyak pengalaman berkesan selama masa SMA saya.\r\nPuncak pencapaian terbesarnya adalah ketika saya dan tim meraih juara umum dalam perlombaan PMR Wira yang diadakan di Universitas Riau.\r\nKemudian, berbekal dengan ilmu yang saya miliki sebelumnya, saya sedikit demi sedikit tahu dan paham indikasi dari beberapa jenis penyakit serta jenis obat apa yang mampu menyembuhkan penyakit tersebut.\r\nPada PMR kali ini saya dipercayakan sebagai wakil ketua organisasi.\r\n\r\nOrganisasi selanjutnya yang saya ikuti adalah Judicial Review (JR) .Judicial Review adalah organisasi yang berfokus pada peningkatan kemampuan berpikir secara kritis terhadap permasalahan dan isu - isu politik bangsa yang berdasarkan kepada 4 pilar kebangsaan. Biasanya anggota JR difokuskan untuk menguasai 2 bidang perlombaan  tertentu.\r\nBidang - bidang tersebut diantaranya, debat, lomba cerdas cermat (LCC) dan, karya tulis ilmiah.\r\nSaya sendiri termasuk kedalam anggota bidang lomba cerdas cermat dan karya tulis ilmiah.\r\nSaya juga dipercaya sebagai wakil ketua organisasi ini.\r\nPengalaman yang tak terlupakan adalah saat organisasi JR ini berhasil mendapatkan juara 1 LCC 4 Pilar MPR RI se Kota Pekanbaru dan mendapatkan juara 2 LCC 4 Pilar MPR RI se Provinsi Riau.\r\nSungguh sebuah kehormatan bagi kami karena LCC ini diselenggarakan oleh Majelis Permusyawaratan Rakyat (MPR)  RI dan jika\r\nberhasil membawa nama provinsi ke tingkat nasional, para tim tersebut akan langsung di undang ke kantor MPR RI untuk melaksanakan perlombaan.\r\n\r\nOrganisasi selanjutnya yang saya ikuti adalah Klub Matematika (KM) \r\nSama seperti eskul matematika yang saya ikuti semasa SMP, KM ini juga memberikan pelajaran matematika tambahan diluar jam pelajaran sekolah.\r\nSehingga pada saat ulangan dan ujian, anggota KM diharapkan lebih mudah dalam menjawab soal dan mendapatkan nilai yang lebih tinggi daripada mereka yang bukan anggota KM.\r\nDi organisasi ini saya juga pernah beberapa kali diutus sebagai perwakilan sekolah dalam perlombaan olimpiade matematika tingkat provinsi.\r\nTetapi, karena ingin fokus kepada 2 organisasi saja yaitu PMR dan JR akhirnya saat kelas 11 saya keluar mengundurkan diri dari organisasi ini.\r\n\r\nSelanjutnya, organisasi non akademik yang saya ikuti semasa SMA adalah komunitas Pekanbaru Beauty Blogger (PKUBB).\r\nSeperti yang sudah saya sebutkan sekilas saat pengenalan diri.\r\nSebagai informasi, PKUBB adalah sebuah wadah organisasi masyarakat Kota Pekanbaru yang beranggotakan para beauty vlogger, beautu blogger, dan beauty enthusiast yang bertujuan menjalin relasi, belajar, dan berbagi ilmu serta tips tentang kecantikan.\r\nDi PKUBB ini, saya juga diajarkan cara menulis dan membuat blog dengan benar, dan juga berkesempatan untuk mengadakan kegiatan sosial dan event menarik lainnya khususnya di wilayah Kota Pekanbaru.\r\n\r\nDi dalam organisasi ini, saya termasuk salah satu anggota yang termuda.\r\nWalaupun demikian, hal itu tidak menjadi penghalang dan mematahkam semangat saya. Tetapi, akan saya jadikan sebagai motivasi supaya saya bisa terus berkembang menjadi pribadi yang lebih baik lagi ke depannya.\r\n\r\nD. Sekarang\r\n\r\nOrganisasi yang saya masih tergabung di dalamnya hanya organisasi PKUBB.\r\nHal itu disebabkan karena PKUBB adalah komunitas masyarakat yang keanggotaannya tidak terpaut usia, dan jika ingin bergabung di dalamnya, harus mengikuti berbagai seleksi dahulu.\r\n\r\nSedangkan, organisasi PMR dan JR  adalah organisasi yang berada di bawah naungan sekolah. Dikarenakan saya sudah tamat SMA  dan menjadi mahasiswa, otomatis mengharuskan saya untuk tidak aktif lagi di dalam organisasi tersebut.\r\n\r\nKemudian saat ini saya sedang aktif mengikuti beberapa organisasi lainnya, yaitu BEM di Fakultas Farmasi yakni di Divisi Eksternal. Saya juga aktif di organisasi kemahasiswaan farmasi intra kampus. Yakni Ikatan Senat Mahasiswa Farmasi Seluruh Indonesia (ISMAFARSI). ISMAFARSI saat ini sedang berganti kepengurusan, dan saya sedang menyiapkan diri untuk mengisi kekosongan jabatan di organisasi bergengsi tersebut. ',	1,	1655745269,	NULL,	0),
('SCHLR-NSH-e868ea',	'USR-NSH-d155f2',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655443402,	NULL,	0),
('SCHLR-NSHDY-a1a7fa',	'USR-NSHDY-3118f',	'Anis hidayah',	'2004-08-02',	'85892158254',	'Rejosari Pranten Bawang Batang Jawa tengah ',	'Teknik informatika ',	'Unsiq',	'0.00',	'0',	'Saya baru lulus SMA dengan kata lain saya belum kuliah',	'Menjadi orang berguna\r\nDengan berkuliah',	'Tidak ',	1,	1653567259,	NULL,	0),
('SCHLR-NSPRS-64585e',	'USR-NSPRS-6f595',	'120140087_Anisa Prasetya',	'2001-11-11',	'83169742215',	'Jl. Kesuma Bangsa LK II',	'Teknik Informatika',	'Institut Teknologi Sumatera',	'3.51',	'4',	'Perkenalkan nama saya Anisa Prasetya, dalam keseharian saya dipanggil dengan\r\nnama Anisa. Prasetya bukanlah sebuah marga, melainkan kata itu berarti setia atau\r\nmenepati janji. Saya tidak terlalu paham kenapa orang tua saya memberikan nama\r\nitu, pernah dengar kata “nama adalah doa” bukan? Mungkin, kedua orang tua saya\r\ningin saya menjadi wanita yang selalu menepati janji, oleh sebab itulah saya berada\r\ndisini.\r\nSaya lahir pada tanggal 11 November 2001 di Bandar Lampung, Indonesia.\r\nMerupakan anak pertama dari dua bersaudara dan tentunya kami adalah keluarga\r\nsederhana yang bahagia. Sampai sini saja perkenalan singkat dari saya, lain kali\r\nakan saya ceritakan mengenai keluarga saya lebih detail.\r\nSebenarnya banyak kata yang bisa digunakan untuk menggambarkan\r\nkepribadianku. Mulai dari pemberani, ceria, multitalent dan tentunya seperti\r\nperkataan penuh harapan anak di kota besar pada umumnya. Saya menamatkan\r\nSekolah Menengah Atas (SMA) di kota kelahiran saya yaitu SMA Negeri 5 Bandar\r\nLampung dan masuk top 20 siswa penerima kuota Seleksi Nasional Masuk\r\nPerguruan Tinggi Negeri (SNMPTN). Hal itu tentunya bukan hal yang luar biasa,\r\nkarena hampir semua orang bisa mendapatkan itu. Sebelum berlanjut menceritakan\r\nprogram studi apa yang saya ambil, sebenarnya ada cerita menarik jauh sebelum\r\nsaya memilih program studi saya sekarang yaitu teknik informatika. Percaya atau\r\ntidak, prodi itu bukanlah pilihan yang saya ambil dan bahkan saya tidak pernah\r\nmemikirkan akan memilih prodi itu di dalam hidup saya. Sebenarnya basic saya\r\nadalah matematika, oleh karena itu saya mengikuti banyak perlombaan yang\r\nberhubungan dengan matematika mulai dari olympiade, lct sampai presentasi.\r\nTentu dari sini bisa ditebak apa yang akan saya pilih sebagai prodi saya ketika\r\nkuliah. Pernah dengar kalimat “Manusia boleh berencana tapi Tuhan yang\r\n\r\nmenentukan hasilnya?”, seperti itulah kehidupan saya. Setelah menetapkan pilihan\r\nprodi kedua berulang kali seperti sains atmosfer keplanetan, teknologi pangan, dan\r\nberhenti pada sains aktuaria, rasanya masih ada kejanggalan padahal saya sudah\r\nyakin akan diterima di pilihan pertama. Sepuluh menit sebelum pilihan prodi\r\ndikumpulkan ke sekolah, saya memilih teknik informatika sebagai piihan terakhir\r\nsaya berbekal video yang saya tonton yang menyadarkan saya tentang sangat\r\nlambatnya laju pertumbuhan ilmu pengetahuan dan teknologi (Iptek) di Indonesia,\r\ndan disinilah saya berada sekarang.',	'Cita-cita saya setelah lulus adalah menjadi pengusaha yang memiliki perusahaan\r\nberbasiskan teknologi baik dari kuliner, fashion, sampai management influencer.\r\nSebenarnya salah satu mimpi terbesar adalah bukan bagaimana saya menjadi\r\npengusaha yang kaya tetapi dari perjalanan menuju kesana yaitu dari titik 0 saya\r\ningin memulai perjalanan di dalam buku kehidupan bersama seseorang sampai\r\nkami suskes bersama.\r\nNamun, suskses tanpa usaha adalah bohong belaka. Seperti mahasiswa lain yang\r\nmengeluh tentang beratnya dunia perkuliahan apalagi ditambah dengan fakta bahwa\r\nprodi yang saya masuki sekarang adalah salah satu yang tersulit membuat saya\r\ninsecure dan berfikir “Mengapa saya ada disini?”. Sebagai manusia biasa tentunya\r\nterkadang saya memiliki rasa kurang percaya diri, takut bahkan stress karena\r\nmelihat sulitnya mata kuliah yang saya hadapi ditambah banyak mahasiswa yang\r\nsangat pandai jauh diatas saya. Namun, disisi lain saya juga memiliki prinsip “hard\r\nwork beats talent when talent doesn’t work hard” yang maknanya kerja keras akan\r\nmengalahkan sebuah bakat, ketika bakat itu tidak bekerja keras. Prinsip itu\r\nmengatakan orang dengan bakat tertentu jika tinggal di zona nyaman, tidak mau\r\nberusaha dan tidak serius akan tertinggal dengan orang biasa yang bekerja keras\r\ndalam usahanya. Satu kalimat itulah yang membuat saya yakin dan semangat\r\nsampai sekarang.\r\nMenarik bukan cerita diatas. Pernahkah kalian mengalaminya juga? Atau bahkan\r\nlebih mengerikan dari cerita diatas?\r\nSetiap orang pasti memiliki cerita-cerita yang mereka anggap sangat mengesankan\r\ndan tidak dapat dilupakan sepanjang hidupnya. Biasanya cerita-cerita tersebut akan\r\n\r\nkita ceritakan kembali kepada anak cucu kita kelak dan akan menjadi kenangan\r\nsemasa kita hidup. Semoga dapat bermanfaat dan bisa menjadi referensi\r\npembelajaran dalam kehidupan.',	'1. Saya pernah menjadi sekretaris Umum ekstrakurikuler Rohani Islam di SMA\r\n2. Pernah menjadi Sekretaris Umum Remaja Islam Masjid 2016-2019\r\n3. Pernah menjadi Bendahara Umum Remaja Islam Masjid 2020-2021\r\n4. Pernah menjadi Mentor dalam 1st Meet Jurusan Informatika 2021',	1,	1654993942,	NULL,	0),
('SCHLR-NSPSP-6d2bee',	'USR-NSPSP-18eea',	'Nisa Puspita',	'2002-12-04',	'85761300679',	'Dusun Blora Desa Sidodadi Ramunia Kec Beringin Deli Serdang',	'S1-PGSD',	'Universitas Muslim Nusantara A',	'3.63',	'2',	'Nama saya Nisa Puspita umur saya 19 tahun saya tinggal dgn ortu saya . Saya senang bertualang dan hal yg unik saya senang dlm berorganisasi namun saya tidak terlalu suka keramaian. Saya senang bljr secara langsung dan saya senang sekali menari.',	'Mimpi terbesar saya adalah membahagiakan orang tua saya dgn memberikan mereka tiket umrah kelak.untuk itu saya trus bljr dan berjuang dan bekerja keras untuk mencapai tujuan dan mimpi saya untuk masa depan mendidik anak-anak Indonesia.',	'Iy, saya mempunyai pengalaman organisasi baik di Pramuka dan organisasi dakwah,saat ini saya sedang dlm organisasi Himpunan mahasiswa Al-Washliyah Medan. Menjadi salah satu bagian di Himmah adalah hal yg luar biasa dan dpt menambah wawasan lebih yg tidak didapatkan dlm akademik.',	1,	1655627393,	NULL,	0),
('SCHLR-NSRHM-c82075',	'USR-NSRHM-0db97',	'Anisa Rahmawati ',	'2002-06-18',	'895376486280',	'Jl. Tp. Sriwijaya lorong hamba RT 03, Kel. Beliung kec. Alam berajo',	'Ilmu Kesehatan masyarakat ',	'Universitas Jambi ',	'3.55',	'4',	'Saya Anisa Rahmawati sering di panggil dengan Anisa, lahir di Jambi 18 Juni 2002 saya punya 2 adik kembar. Saya bertempat tinggal di kota Jambi bersama kedua orang tua serta 2 adik saya, ayah saya bekerja buruh dan ibu saya ibu rumah tangga dengan penghasilan orang tua saya cukup untuk membiayai kehidupan saya. Saya sedang menjalani pendidikan kuliah di universitas Jambi dengan jurusan ilmu kesehatan masyarakat sedang menempuh semester 4 mau semester 5. Hobi saya adalah membaca buku fiksi namun mulai sering membaca buku non fiksi untuk keperluan kuliah dan menambah wawasan. Selama perkuliahan saya belum mengikuti organisasi himpunan di tempat saya kuliah. Saya lebih fokus untuk mengikuti pelajaran saat kuliah. namun beberapa kali saya mengikuti volunteer campaign di platform Instagram. Saya mampu bekerjasama dengan tim untuk bisa tercapai nya tujuan terkadang saya malu untuk memulai komunikasi tapi saya mampu untuk mengatasi hal itu. ',	'Karena saya kuliah jurusan ilmu kesehatan masyarakat, saya mempunyai mimpi untuk membantu dan berhasil menciptakan masyarakat sehat dengan promotif dan preventif, dimana untuk mewujudkan hal tersebut perlu ketekunan serta kemauan untuk meraih cita-cita tersebut. Dengan mengikuti perkuliahan dan lulus dengan hal yang memuaskan ',	'Saat perkuliahan saya belum mengikuti organisasi, di luar perkuliahan saya pernah mengikuti volunteer campaign online dari platform Instagram. Saat SMA saya menjadi anggota Rohis atau rohani Islam bertugas untuk membantu teman saya sebagai divisi',	1,	1655603660,	NULL,	0),
('SCHLR-NSSYL-e248df',	'USR-NSSYL-d5d55',	'Anis syalsabila',	'2003-07-28',	'85722332711',	'Kp Ciketing Rawamulya, Gg. H. Latief 3, RT.002/003 Kec. Mustika Jaya, Kel. Mustika Jaya, Kota Bekasi 17158',	'Akuntansi Fakultas Ekonomi',	'Universitas Negeri Jakarta',	'3.97',	'2',	'Saya adalah orang yang berdedikasi penuh atas tanggung jawab yang diberikan kepada saya. Ketika saya tergabung ke dalam suatu kelompok atau organisasi, saya akan berusaha melakukan pekerjaan saya dengan semaksimal mungkin. ketika tergabung dalam sebuah kelompok, saya senang berkontribusi dan menyalurkan ide serta pendapat saya. Saya memiliki kepribadian extrovert, yang membuat saya mudah beradaptasi dengan lingkungan baru dan juga memiliki kepercayaan diri yang baik. Dalam menyelesaikan sebuah masalah, biasanya saya bisa bersikap tenang dan mencari jalan keluar dengan solusi yang realistis sesuai dengan situasi dan kondisi yang sedang dihadapi. Saya merasa dengan pengalaman organisasi yang saya miliki, menjadikan saya orang yang berjiwa leadership tinggi. Saya memiliki bakat dalam bernyanyi.\r\n',	'mimpi terbesar saya yaitu:\r\n1. Dapat membahagiakan orang tua saya yang sudah berusaha mati-matian untuk menyekolahkan saya hingga bangku kuliah saat ini. \r\n2. Membalas semua kebaikan orang-orang terdekat saya yang sudah mereka lakukan ke saya selama ini\r\n3. Sukses dunia dan akhirat serta dapat bekerja di tempat yang sesuai dengan preferensi saya \r\n4. Membuka lapangan pekerjaan untuk orang-orang yang membutuhkan\r\n5. Menyekolahkan adik-adik saya hingga mereka sukses\r\n6. Selalu hidup dengan rasa syukur kepada Allah SWT\r\n7. Menjalani kehidupan hingga tua dengan selalu bersikap baik dan tidak melanggar perintah Allah.\r\n\r\ncara saya mewujudkannya:\r\n1. Membuat rencana jangka pendek dan jangka panjang tentang strategi atau tahapan saya dalam mewujudkan mimpi saya\r\n2. selalu kepada Allah\r\n3. ikhtiar dengan semangat dan terus berusaha memperbaiki diri\r\n4. membantu orang lain jika kesulitan \r\n5. evaluasi diri',	'Organisasi:\r\n1. ORGANISASI SISWA INTRA SEKOLAH (OSIS) sebagai Koordinator seksi bidang 5\r\nyaitu menangani bidang pembinaan demokrasi, pendidikan politik, HAM, lingkungan hidup, toleransi dalam konteks masyarakat plural.\r\n2. BADAN EKSEKUTIF MAHASISWA (BEM) PRODI AKUNTANSI sebagai Staff Departemen Kesejahteraan Mahasiswa. Yaitu Menjembatani dan melayani kebutuhan mahasiswa, melakukan pelayanan terhadap permasalahan-permasalahan yang dialami mahasiswa Prodi Akuntansi guna meningkatkan kesejahteraan mahasiswa Prodi Akuntansi.\r\n\r\nRelawan:\r\nRELAWAN COMDEV FE 2021 sebagai Staff Divisi Pengabdian Masyarakat.\r\nYaitu Mengembangkan potensi masyarakat yang ada dengan melakukan pelatihan dan sosialisasi',	1,	1655744036,	NULL,	0),
('SCHLR-NSTNS-e0cac6',	'USR-NSTNS-a8f84',	'Nosten Saputra Sitorus',	'2002-11-06',	'82289241301',	'Sulawesi Selatan, Makassar Rapocini Kompleks pemda ',	'jurusan psikologi  prodi psiko',	'Universitas Negeri  Makassar',	'3.31',	'2',	'Saya Nosten Saputra Sitorus, asal Sumatera Utara, lahir 06 November 2022. Saya sedang menempuh pendidikan di Universitas Negeri Makassar dengan Jurusan Psikologi, Dan saya bercita cita menjadi Psikolog di bidang klinis. Saya Anak ketiga dari 4 bersaudara, saat ini orang tua saya hanya ada papa, mama saya telah meninggal 11 tahun yang lalu, latar belakang keluarga saya cukup berat ayah saya petani adik saya saat ini sedang menempuh pendidikan di perguruan tinggi Di Provinsi Riau. Saya memiliki beberapa pencapain di bidang akademik Semasa SMA di kelas 10 menjadi utusan sekolah olimpiade OSN bidang geografi, kemudan saya menjadi ketua KIR di SMA periode 2019-2020. Saya adalah pribadi yang selalu menghargai kesempatan dan tidak pernah takut gagal. ',	'Impian terbesar saya saat ini adalah bisa Melanjutkan S2 di Harvad UNiversity, dan bisa membangun klinik sendiri di tempat asal dan melayani serta meningkatkan sumberdaya manusia di daerah asal saya. Saat ini cara saya mewujudkannya adalah dengan mulai belajar bahasa inggris dan membangun kebiasaan 1 persen lebih baik untuk bisa mewujudkan cita cita saya, karena saya menyakini walau dengan satu persen setiap  hari akan mampu membuat saya bisa pada tahap aktualisasi diri yang optimal.',	'saat ini saya menjadi anggota komunitas Debat di Universitas Negeri Makassar, Saya semasa SMA menjadi anggota KIR semala satau tahun dan menjadi ketua bahasa di SMA saya pada saat saya kelas 2 SMA.',	1,	1654643371,	NULL,	0),
('SCHLR-NTFRN-973024',	'USR-NTFRN-82010',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655694006,	NULL,	0),
('SCHLR-NTFRN-ad30a4',	'USR-NTFRN-82010',	'Anita Ferninda Putri',	'2002-10-03',	'85702481084',	'Desa Dawu, Dusun Dawu, Kecamatan Paron, Kabupaten Ngawi, Jawa Timur.',	'Pendidikan Bahasa Arab',	'Universitas Negeri Malang',	'2.92',	'2',	'Saya seorang mahasiswi semester 2 di Universitas Negeri Malang yang mengambil prodi pendidikan bahasa Arab. Ayah saya seorang petani dan bekerja serabutan, sedangkan ibu kandung saya sudah tiada sejak saya kelas 3 Mts. Saya bisa merasakan bangku kuliah di Universitas Negeri Malang (UM) sangat bersyukur, karena ortu saya awalnya tidak membolehkan dengan alasan biaya hidup di Malang dan UKT terbilang mahal. Alhasil ortu saya memberikan saya izin untuk kuliah dengan tantangan UKT ditanggung ortu sedangkan biaya hidup seperti kost dan makan jangan mengandalkan ortu terus, saya pun menerima tantangan itu dengan modal bismillah. Baru selesai ujian praktik di SMK saya memberanikan diri untuk bekerja selama 4 bulan lebih 7 hari dengan gaji 750-800 ribu rupiah perbulan. Dari sini saya merasakan bagaimana susahnya cari uang, dari sini juga saya bisa membantu ortu saya meskipun tidak banyak. Dan saat ini pun saya kuliah masih di sambi dengan bekerja sampingan yakni mengajar les privat, karena mengingat saya harus mandiri.',	'Mimpi terbesarku ialah jadi orang sukses yang bisa menebar kebermanfaatan. perihal pekerjaan saya ingin menjadi seorang PNS/ pengajar karena menurut saya pribadi dengan menjadi PNS ortu saya bisa bangga. Jujurly dari keturunan ortu saya belum ada yang bisa lanjut pendidikan hingga perkuliahan ataupun jadi PNS karena keterbatasan finansial dan mengharuskan untuk bekerja. Selain itu dengan menjadi PNS saya bisa ikut serta dalam program mencerdaskan anak bangsa. Cara saya untuk mewujudkan mimpi saya yaitu dengan belajar dan belajar. Selain itu saya juga mengikuti beberapa organisasi, webinar, mentoring dan pelatihan-pelatihan yang bisa meningkatkan skill dan menambah pengalaman.',	'Iya, saya mempunyai pengalaman organisasi. Saya pernah diamanahi menjadi bendahara dan wakil ketua sewaktu organisasi SMK. Saat ini di kampus saya mengikuti UKM Al-Quran Study Club (ASC) dan Himpunan Mahasiswa Departemen (HMD) Sastra Arab. Di UKM ASC saya sebagai pengurus bidang kurikulum Tafaqquh Fii Dinil Islam yang mana merupakan bagian dari 1 SKS matkul Univ yakni PAI, sedangkan di HMD Sastra Arab saya sebagai anggota aktif bidang kerohanian yang mana tugasnya mengatur kegiatan PHBI, santunan anak panti, dll.',	1,	1655695907,	NULL,	0),
('SCHLR-NTKDW-d4e7b6',	'USR-NTKDW-ad243',	'Antik Dwi Mukti',	'2002-07-01',	'85733322984',	'Desa Dungmiri, Kecamatan Karangjati, Kabupaten Ngawi\r\nRT 02/RW 01\r\nKode Pos 63284',	'Manajemen Fakultas Ekonomi dan',	'Universitas Negeri Malang',	'3.82',	'2',	'Saya Antik Dwi Mukti anak kedua dari pasangan keluarga Ibu Sri Muryani dan Bapak Suparno (alm). Saya alumni dari SMKN 1 Ngawi jurusan akuntansi dan sekarang melanjutkan studi di Jurusan Manajemen Universitas Negeri Malang. Saya merupakan anak introvert dimana saya bisa fokus ketika saya sendiri dan dalam suasana hening. Namun, saya tidak berjalan di zona nyaman tersebut. Hal ini dibuktikan dengan aktifnya saya di berbagai organisasi mulai duduk di bangku SMP. Di UM saya aktif di organisasi LP3ME yang bergerak di bidang kepenulisan. Saya menjadi staff dari bidang Networking. Selain aktif di organisasi tersebut, selama berkuliah saya juga ikut serta dalam kepanitiaan seperti MUSGA (Musyawarah Anggota) pada bulan Januari 2022 dengan menjadi CO PDD, Forsmawi Education Fair pada bulan Januari 2022 dengan menjadi staff logistik, Permasa Ngawi Expo pada bulan Januari 2022 dengan menjadi CO PDD dan sekarang fokus untuk ikut serta menyusun program kerja Gebyar pada bulan oktober mendatang dan di amanah i menjadi CO PDD. Dengan keluarnya saya dari zona nyaman yang sering menyendiri tersebut membuat saya bisa berlatih untuk bekerja sama dengan orang lain, melatih leadership, publick speaking, dan berusaha untuk menyelesaikan masalah dengan mengambil kesepakatan yang tepat.',	'Tentunya saya ingin menjadi seseorang yang bermanfaat untuk orang banyak khususnya negara. Hal ini maksudnya saya ingin menjadi seorang dosen khususnya bidang manajemen. Hal ini saya sudah rencanakan sejak bangku SMK dimana ketika ditanya oleh Bu Inna selaku guru akuntansi bahwasanya saya tertarik menjadi dosen. \r\nUntuk mewujudkannya saya mulai belajar dengan sungguh-sungguh di bangku SMK dan berusaha mengejar PTN melalui jalur SNMPTN dan alhamdulillah saya diberikan jalan masuk ke UM walaupun saya anak SMK. Harapannya dengan menjadi dosen saya bisa memberikan ilmu saya agar memajukan generasi muda yang mampu bersaing dengan tenaga kerja luar yang tidak hanya pandai dalam akademik tetapi juga pandai dalam praktiknya.',	'Di bangku kuliah saya mengikuti organisasi LP3ME yang bergerak di bidang kepenulisan dan menjadi staff dari bidang Networking. Saya bertugas untuk membuat konten di beberapa sosial media LP3ME dibantu 3 orang teman saya. Setiap 2 bulan sekali kami bergilir untuk mengelola konten baik di instagram, twitter, youtube, facebook, dan youtube. Selain aktif di organisasi tersebut, selama berkuliah saya juga ikut serta dalam kepanitiaan seperti MUSGA (Musyawarah Anggota) pada bulan Januari 2022 dengan menjadi CO PDD. Dalam acara tersebut saya tentunya bertugas untuk mengkoordinasikan semua tugas yang ada di PDD dan membagi tiap jobdesk ke teman-teman, begitupun dengan tugas saya di Permasa Ngawi Expo pada bulan Januari 2022 dengan menjadi CO PDD dan sekarang fokus untuk ikut serta menyusun program kerja Gebyar pada bulan oktober mendatang dan di amanah i menjadi CO PDD. Sedangkan Forsmawi Education Fair pada bulan Januari 2022 dengan menjadi staff logistik saya bertugas untuk membuat daftar perlengkapan yang dibutuhkan selama acara.',	1,	1655724555,	NULL,	0),
('SCHLR-NTKHF-aa7bc7',	'USR-NTKHF-f86c0',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654527332,	NULL,	0),
('SCHLR-NTKHR-67b99c',	'USR-NTKHR-762ff',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1653829357,	NULL,	0),
('SCHLR-NTNDS-33fa56',	'USR-NTNDS-e19eb',	'Intan Dasriany Sihombing',	'2003-03-10',	'85296958547',	'Jl. Garu II A Gg. Nusa Indah No. 28 F Medan',	'Pendidikan bahasa Inggris',	'Universitas Negeri Medan',	'3.58',	'2',	'Saya adalah seorang dara yang memiliki minat terhadap isu lingkungan, sosial, dan pendidikan. Saya gemar menulis cerpen. Saat ini, saya tengah berusaha untuk mengejar beasiswa untuk membantu biaya UKT. Tidak hanya itu, saya juga berusaha untuk mempelajari banyak hal baru selama masa perkuliahan ',	'Impian terbesar saya adalah berjalan jalan ke Inggris. Untuk mewujudkannya, selama perkuliahan ini saya memaksimalkan seluruh kemampuan saya dalam bidang bahasa Inggris. Selain itu, saya akan belajar sungguh sungguh agar bisa lulus tepat waktu dan bisa segera bekerja agar pendapatan yang nantinya akan saya tabung bisa saya gunakan untuk mencapai mimpi saya',	'Ya, pernah. Saat ini saya bergabung di sebuah organisasi di kampus yang bernama English Department Writing Club. Organisasi ini fokus untuk mengasah kemampuan menulis',	1,	1655134442,	NULL,	0),
('SCHLR-NTNND-8e43d8',	'USR-NTNND-cbe55',	'INTAN NADILAH',	'2005-12-19',	'82144612248',	'Manggemaci, kecamatan mpunda kota Bima NTB Indonesia',	'MIPA',	'SMAN 4 kota Bima',	'0',	'0',	'Saya intan nadilah biasa disebut intan. Saya 2 bersaudara saya merupakan anak bungsu. Saudara kandung saya yaitu laki laki dan dia sekarang sedang berkuliah. Orang tua saya bisa di bilang dengan pekerjaan yang dengan gaji yang cukup. Tapi orang tua ku selalu mengajarkan kepada anak-anak nya bagaimana cara menghemat. Karena hidup itu berputar. Dari kecil selalu seperti itu. Sekarang saya sudah duduk di bangku SMA kelas 12 di SMAN 4 kota Bima yang bisa di bilang banyak prestasinya dan katanya terakreditasi A. Saya belajar disana dengan fasilitas yg mungkin menurut sy kurang tapi tidak apa apa yang penting saya tetap semangat dan mau berusaha. Saya senang sekali kemarin tepatnya hari Sabtu diminggu kemarin saya mendapat ranking 1, orang tua ku sangat senang mendengar hal itu. Saya sangat menyukai matematika dan IPA entah kenapa nyaman aja gituu',	'Kuliah di luar negeri dan Dengan giat belajar, berusaha mencari informasi terkait, berdoa, dan mendapatkan restu orang tua',	'Ya, pertama rohis( rohani Islam) organisasi ini dibawah naungan OSIS. Jadi setiap ada event keagamaan kami sebagai anggota rohis bekerja sama dengan OSIS bidang keagamaan dan ketaqwaan disini kami belajar bagaimana menurunkan ego, teamwork, surat menyurat, dan masih banyak lagi...\r\nKedua, forum anak Mbojo di sini saya baru saja bergabung dengan demikian saya benar benar mendapatkan hal-hal yang menurut saya cukup baru dalam pengalaman organisasi. Saya mengetahui bahwa kami sebagai forum anak Mbojo sebagai 2p yaitu pelapor dan pelopor dan bertujuan untuk menyuarakan hak anak dan sebagainya...\r\nKetiga, komtabs: saya baru saja bergabung tahun lalu dan sekarang sedang ada projects volunteer chapter ke 3 kelas tanpa batas di SDN 51 rite di sana kami mengajarkan hal-hal dan pelajaran dasar yang ada di sekolah seperti bahasa Inggris, matematika, agama Islam dan lain lain',	1,	1655738364,	NULL,	0),
('SCHLR-NTNZZ-63eb67',	'USR-NTNZZ-7c163',	'Intan Azzahra',	'2000-05-27',	'85694293051',	'Jl. Pangkalan asem rt 02 rw 02 bantar gebang, bantar gebang, bekasi 17151',	'PGPAUD/Fakultas Ilmu Pendidika',	'Universitas Negeri Jakarta',	'3.78',	'4',	'Halo perkenalkan nama saya Intan Azzahra, biasa dipanggil Intan. Saya merupakan anak pertama dari dua bersaudara. Sekarang saya sedang menempuh pendidikan di jalur universitas dengan jurusan PG PAUD dari Universitas Negeri Jakarta dan sedang berada di semester 4. Saya memiliki Hobi yaitu memasak, membaca buku dan mendengarkan musik. Saya juga suka membaca jurnal-jurnal yang berkaitan erat dengan anak-anak ataupun Parenting. Saya aktif sebagai volunteer baik di dalam Universitas maupun di luar universitas. Saya juga senang hal-hal yang menantang diri saya untuk ikut masuk ke dalamnya misalnya seperti menjadi anggota kepanitiaan, belajar untuk menjadi MC ataupun moderator, dan ikut lomba-lomba yang sekiranya dapat meningkatkan potensi diri saya.',	'Mimpi besar saya adalah menjadi seorang psikolog anak ataupun konselor anak. Menjadi seorang psikolog ataupun konseler saya perlu mengenyam di dunia pendidikan yang lainnya yaitu psikologi. Dan untuk mewujudkannya saya harus mampu untuk meningkatkan diri saya untuk semakin termotivasi dalam belajar agar dapat melanjutkan studi S2 dan mengenyam pendidikan di jurusan Psikologi. ',	'Saya memiliki beberapa pengalaman di dalam organisasi kepanitiaan yang ada di dalam Prodi saya. Saya pernah menjadi seksi acara di tiga kegiatan yang berbeda dan dalam jangka waktu yang berbeda yaitu api unggun PAUD 2020, Pascha (Paud Sharing and Caring) PGPAUD 2020, Fespa (Festival Paud)2020. Di acara api unggun PAUD 2020 saya menjadi salah satu moderator dari kegiatan tersebut. Dan pada acara PAUD sharing and caring 2020 saya menjadi salah satu MC. Tidak hanya di dalam Prodi saja, saya juga ikut berpartisipasi dalam acara pkkmb 2021 menjadi fasil untuk acara fakultas. Di sana saya mengarahkan adik-adik mahasiswa baru untuk mengikuti seluruh rangkaian acara yang dilaksanakan oleh fakultas.',	1,	1653632980,	NULL,	0),
('SCHLR-NTPRS-ea299a',	'USR-NTPRS-20ac6',	'Nita Prasyama Azhari',	'2003-10-10',	'89649714206',	'Teloyo Kulon, RT.03/01, Teloyo, Wonosari, Klaten, Jawa Tengah',	'Pendidikan IPA',	'Universitas Negeri Yogyakarta',	'3.83',	'2',	'Perkenalkan nama saya Nita Prasyama Azhari. Saat ini saya berstudi di Universitas Negeri Yogyakarta prodi Pendidikan IPA. Perjuangan yang sangat panjang hingga saya dapat menjadi mahasiswa di kampus ini, setelah begitu banyak penolakan yang menghampiri saya. Saya bersyukur, selama menempuh studi dari SD sampai sekarang, saya selalu mendapat prestasi di setiap jenjangnya. Dan sampai kapanpun saya akan selalu berusaha untuk mempertahankan dan meningkatkan prestasi saya.',	'Mimpi terbesar saya, yaitu saya ingin menjadikan ilmu yang telah saya pelajari selama masa kuliah bermanfaat bagi orang-orang disekeliling saya. Saya ingin memberikan kontribusi bagi kemajuan pendidikan mulai dări lingkup terdekat saya dan orang-orang disekeliling saya. karena saya yakin sedikit dan sekecil apapun perubahan ke arah yang baik akan membawa perubahan yang besar.\r\nCara saya mewujudkan mimpi yaitu dengan mulai melakukan perubahan-perubahan kecil dalam hidup saya, mulai belajar untuk berdisiplin dengan setiap kewajiban saya selain itu saya juga mencoba hal-hal baru yang dapat memberikan sudut pandang dan pengalaman yang baru bagi saya. Selalu memanfaatkan setiap kesempatan yang ada.',	'Saya memiliki pengalaman berorganisasi di kampus saya, saya menjadi pengurus inti yang mengurus manajerial organisasi yaitu bendahara. Dari organisasi yang saya ikuti ini, saya mendapatkan banyak pelajaran yang sanat berguna bagi saya yaitu saya menjadi lebih percaya diri untuk berbicara di depan umum, belajar memimpin orang lain, dapat menyelesaikan permasalahan dengan tenang, dan banyak lagi lainnya.\r\nSelain mengikuti organisasi saya juga mengikuti berbagai kepanitiaan di lingkungan kampus, dari kepanitiaan yang saya ikuti saya juga belajar banyak hal dari sana salah satunya adalah cara berosisalisasi dengen banyak orang yang berbeda-beda sifatnya.',	1,	1654358813,	NULL,	0),
('SCHLR-NTSYY-1c7f12',	'USR-NTSYY-571c8',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655662680,	NULL,	0),
('SCHLR-NTSYY-80e31c',	'USR-NTSYY-f1656',	'Natasya Yu',	'2001-09-05',	'85156569171',	'Jl. Sutoyo S, Gg. Serumpun, Banjarmasin, Kalimantan Selatan',	'Psikologi',	'Universitas Padjadjaran',	'2.78',	'2',	'Saya adalah pribadi yang antusias untuk mempelajari hal-hal baru dan mendalami hal yang sudah saya ketahui. Keputusan saya untuk menjadi bagian dari keluarga Fakultas Psikologi Universitas Padjadjaran didasari oleh keinginan saya untuk mendalami Psikologi secara formal, karena saya tertarik untuk mempelajari Psikologi sejak masih SMA. Serta bagi saya, Psikologi merupakan ilmu yang penting dipelajari oleh saya yang memiliki keinginan untuk berkontribusi secara aktif kepada masyarakat. Hal ini disebabkan oleh yang dipelajari dalam Psikologi itu sendiri, yaitu mengenai dasar-dasar perilaku manusia. Menurut saya, jika saya mampu memahami apa yang mendasari perilaku manusia, maka saya juga akan mampu untuk turut membantu dalam pembentukan perilaku masyarakat yang lebih baik dari yang sudah ada saat ini. Saya juga menyadari bahwa diri saya tidak sempurna dan memiliki banyak kekurangan, sehingga saya juga memiliki ambisi untuk mempelajari hal baru sebanyak mungkin dengan harapan agar dapat memperbaiki diri sekaligus meningkatkan potensi diri.',	'Mimpi terbesar saya adalah berhasil mengaktualisasikan diri dan menjadi kompeten untuk memberikan dampak positif dalam meningkatkan kualitas setiap individu yang merupakan masyarakat Indonesia. Mimpi ini merupakan mimpi jangka panjang yang saya miliki dan tentu tidak dapat diwujudkan hanya dalam satu malam, sehingga saya membaginya dalam beberapa tahapan. Tahap pertama, mengenali diri secara dalam. Menurut saya, tahapan ini merupakan tahapan yang krusial karena dengan mengenali diri sendiri lebih dalam, kita dapat mengarahkan jalan hidup mana yang akan kita ambil berdasarkan passion, minat, dan bakat yang kita miliki. Selain itu, kita juga dapat mengetahui kekurangan yang dimiliki. Memiliki pengetahuan mengenai kekurangan yang dimiliki memberikan kesempatan bagi kita untuk merancang perencanaan dalam memperbaiki kekurangan tersebut. Setelah mengenali diri sendiri, maka dapat melanjutkan ke tahap kedua, yaitu mencari tahu dan mengikuti hal apa saja yang dapat memfasilitasi passion, minat, dan bakat yang dimiliki serta yang dapat memfasilitasi perbaikan diri. Saat ini, saya berada di tahap kedua. Saya mengetahui bahwa saya memiliki passion dan minat pada bidang Psikologi, sehingga saya memutuskan untuk melanjutkan studi di perguruan tinggi dan menjadi mahasiswa jurusan Psikologi. Selama berkuliah, saya juga aktif mengikuti kegiatan kepanitiaan yang ada di Fakultas saya karena saya merasa saya dapat meningkatkan potensi diri sekaligus berkontribusi pada kesejahteraan keluarga mahasiswa Fakultas Psikologi melalui kegiatan tersebut. Saya juga menyadari beberapa kekurangan yang belum disadari sebelumnya selama menjalani perkuliahan di sini, dan memutuskan untuk mengikuti konseling dengan Psikolog agar proses perbaikan diri yang sedang saya jalani dapat dilaksanakan secara lebih efektif. Jika saya sudah berhasil meminimalisasi kekurangan yang saya miliki dan telah mempelajari banyak hal yang akan berguna dalam mengejar mimpi terbesar saya, maka saya bisa lanjut ke tahap tiga yang juga merupakan tahap terakhir, yaitu merancang, menciptakan, dan menjalani proyek-proyek sosial yang dapat memberikan dampak positif pada masyarakat. Jika saya sudah berada tahap ini, saya berencana untuk membentuk komunitas atau organisasi non profit yang bergerak pada bidang pendidikan dan/atau kesehatan mental. Saya juga berencana untuk turut aktif meningkatkan kesadaran akan kesehatan mental melalui platform digital dan melalui interaksi langsung dengan cara turun ke lapangan.',	'Sejauh ini, saya hanya memiliki pengalaman mengikuti kegiatan kepanitiaan. Saat ini saya menjadi bagian dari dua kegiatan kepanitiaan, yaitu Penerimaan Mahasiswa Baru 2022 (PMB 2022) yang bertujuan untuk menyambut mahasiswa baru dan Kacamata Psikologi yang bertujuan untuk membahas isu-isu berdasarkan pandangan Psikologi. Menurut saya, kedua kegiatan kepanitiaan ini dapat memberikan dampak positif; PMB 2022 akan membangun pondasi informasi yang baik untuk menopang proses adaptasi mahasiswa baru dan Kacamata Psikologi akan membantu meningkatkan kesadaran mahasiswa terhadap isu yang dibahas di acara utama nanti. Selain aktivitas kepanitiaan, saya sebenarnya juga pernah mengikuti magang di BEM Fakultas Psikologi selama tiga bulan dan mengikuti beberapa kegiatan campaign volunteer dengan cara membagikan beberapa informasi di feed instagram, namun saya merasa belum banyak berkontribusi pada kegiatan tersebut karena saya telat menyadari bahwa visi saya kurang sesuai dengan konsep kegiatan tersebut. Semenjak itu, saya selalu memastikan untuk mengikuti kegiatan yang lebih sesuai dengan visi saya.',	1,	1655663190,	NULL,	0),
('SCHLR-NVLTF-1ec933',	'USR-NVLTF-a0593',	'NOVELITA FATMA ANJANY',	'2005-07-01',	'82245756389',	'TURUPINGGIR, MEGALUH, JOMBANG, JAWA TIMUR',	'MIPA',	'MAN 1 JOMBANG',	'4.00',	'2',	'Saat ini saya sedang belajar di salah satu sekolah agama terbaik di kota saya yaitu MAN 1 JOMBANG, Saya duduk di kelas XI jurusan MIPA, di sekolah saya juga aktif mengikuti Organisasi Siswa Intra Sekolah atau OSIS dan juga aktif mengikuti kelompok belajar olimpiade di sekolah.\r\nSelain kegiatan di sekolah saya juga punya kegiatan di luar sekolah yaitu di desa saya mengikuti IPNU dan IPPNU juga Mengikuti Organisasi Remaja Masjid.\r\nSetelah lulus dari sekolah nanti saya berkeinginan untuk melanjutkan pendidikan di salah satu universitas terbaik di Indonesia yaitu Universitas Brawijaya Malang dengan jurusan Manajemen Bisnis.\r\nSetelahnya saya berencana berbisnis dan membuka lowongan pekerjaan sebanyak-banyaknya yang bisa di kerjakan di mana saja bahkan di keadaan seperti awal pandemi agar tidak banyak pengangguran.',	'Saya ingin berbisnis dan membuka lowongan pekerjaan sebanyak-banyaknya untuk seluruh indonesia yang bisa di kerjakan di mana saja bahkan di keadaan seperti awal pandemi agar tidak banyak pengangguran.\r\nCara saya mewujudkannya saat ini adalah dengan terus giat belajar dan berusaha mendapatkan nilai terbaik sehingga nanti bisa masuk perguruan tinggi yang terbaik untuk melanjutkan pendidikan saya agar mendapatkan ilmu yang bermanfaat untuk rencana saya membuka bisnis dan lowongan pekerjaan di masa depan.',	'Saat ini saya masih bergabung dalam organisasi OSIS di sekolah saya, IPNU IPPNU dan juga Remaja Masjid di desa saya.\r\nPengalaman saya dalam bekerja sama dengan teman-teman saya cukup banyak salah satunya adalah dalam Acara HUT sekolah saya yang ke 31 saya bertugas menjadi Penanggung Jawab Lomba Video Animasi yang lombanya di laksanakan online di karenakan masih dalam masa pandemi, tetapi dengan kompak dan semangat saya dan teman-teman saya sukses membuat acara tetap berjalan lancar dan meriah.',	1,	1654042598,	NULL,	0),
('SCHLR-NVLZZ-3bf440',	'USR-NVLZZ-a14bb',	'Novalia Azzahra',	'2002-11-28',	'85735554894',	'Jl. Raya Harjawinangun RT 07 RW 02 Kecamatan Balapulang Tegal Jawa Tengah',	'Ilmu Hadits',	'Universitas Islam Negeri Sunan',	'3.75',	'4',	'Saya orang yang menyukai hal baru dan tantangan yang baru. Saya siap dan tahan dengan semua tekanan.',	'Mimpi terbesar saya adalah membahagiakan orangtua. Cara saya mewujudkannya adalah dengan terus belajar dan berusaha dengan segala hal baru yang bisa membuat orangtua saya bangga. ',	'Iya, saya memiliki banyak pengalaman organisasi.  Dari himpunan mahasiswa jurusan hingga organisasi daerah. Saya juga pernah jadi relawan mengajar di kampung Al Qur\'an. Saya senang dapat menyalurkan ilmu dan skill saya dalam tiap acara yang ada dalam kegiatan tersebut. ',	1,	1653925730,	NULL,	0),
('SCHLR-NVN-10cbcd',	'USR-NVN-fe9ce1',	'NOVIANA',	'2000-11-13',	'85778645518',	'JL. DWIWARNA A I NO 55 RT 04 RW 01 KELURAHAN KARTINI KECAMATAN SAWAH BESAR DKI JAKARTA ',	'Manajemen ',	'STIE IGI JAKARTA ',	'3.79',	'6',	'Perkenalkan nama saya Noviana saya mahasiswa dari STIE IGI JAKARTA Jurusan Manajemen hobi saya adalah bermain badminton.',	'Mimpi yang paling terbesar saya adalah membangun bisnis yang bisa membantu saya ataupun orang lain.\r\nCaranya: \r\nDengan bekerja keras dahulu  mengumpulkan modal utk mendirikan usaha kecil-kecilan dahulu. Setelah terkumpul uang dan berjalannya waktu saya ingin membuka usaha lebih besar dan menggunakan karyawan supaya mengurangi jumlah pengangguran dan membantu perekonomian yang lain.',	'Pengalaman organisasi: \r\nHumas INTERNAL BEM STIE IGI JAKARTA tahun 2020-2021\r\nTugas: \r\nMengawasi dan mengontrol UKM dengan baik\r\nMenghandle kegiatan kampus yang sedang berlangsung\r\nMenjalin dan membina hubungan,informasi dan komunikasi baik dengan internal atau eksternal kampus\r\n',	1,	1653554677,	NULL,	0),
('SCHLR-NVN-3dd677',	'USR-NVN-fe9ce1',	'NOVIANA',	'2000-11-13',	'85778645518',	'JL. DWIWARNA A I NO 55 RT 04 RW 01 KELURAHAN KARTINI KECAMATAN SAWAH BESAR DKI JAKARTA ',	'Manajemen ',	'STIE IGI JAKARTA ',	'3.79',	'6',	'Perkenalkan nama saya Noviana saya mahasiswa dari STIE IGI JAKARTA Jurusan Manajemen hobi saya adalah bermain badminton.',	'Mimpi yang paling terbesar saya adalah membangun bisnis yang bisa membantu saya ataupun orang lain.\r\nCaranya: \r\nDengan bekerja keras dahulu  mengumpulkan modal utk mendirikan usaha kecil-kecilan dahulu. Setelah terkumpul uang dan berjalannya waktu saya ingin membuka usaha lebih besar dan menggunakan karyawan supaya mengurangi jumlah pengangguran dan membantu perekonomian yang lain.',	'Pengalaman organisasi: \r\nHumas INTERNAL BEM STIE IGI JAKARTA tahun 2020-2021\r\nTugas: \r\nMengawasi dan mengontrol UKM dengan baik\r\nMenghandle kegiatan kampus yang sedang berlangsung\r\nMenjalin dan membina hubungan,informasi dan komunikasi baik dengan internal atau eksternal kampus\r\n',	1,	1653554744,	NULL,	0),
('SCHLR-NVNSR-c337db',	'USR-NVNSR-18cf6',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654674919,	NULL,	0),
('SCHLR-NVRHM-c33736',	'USR-NVRHM-0a877',	'Novia rahmi ',	'2000-11-23',	'81299890902',	'Jln.Assyafiiyah no.229,Cilangkap,Jakarta timur',	'Penerbit',	'Politeknik negeri media kreati',	'3.31',	'2',	'Dengan saya novia rahmi,biasa di panggil via sekarang saya tinggal di daerah Cilangkap,Jakarta timur . Saya seorang mahasiswa di politeknik media kreatif daerah sreseng, jurusan penerbit dan sekarang masih semester 2 mau ke semester 3 . Gak hanya kuliah saya tetapi saya juga mengikuti ekstrakulikuler di kampus saya,saya mempunyai banyak relasi dan lingkungan baru,saya senang dengan membaca motivasi atau membaca novel dan saya sekarang belajar menulis membuat cerpen ',	'Saya ingin membuat keadaan ekonomi keluarga saya lebih baik dan saya tidak ingin memberatkan biaya orang tua untuk itu saya berusaha mencari kerja parttime mencari beasiswa, saya ingin jalan-jalan keluar kota dan saya ingin juga bisa pergi ke mekkah bareng keluarga untuk itu saya harus berusaha belajar dan bekerja mengumpulkan uang untuk bisa pergi bersama dan saya tidak lupa dengan berdoa ',	'Saya sedang mengikuti organisasi Fkmpi di kampus saya,saya divisi sosial masyarakat. Di fkmpi saya dan kawan-kawan aktif membuat acara bersama BEM ,mengumpul bersama dengan politeknik lainnya. Untuk divisi sosial masyarakat saya dan kawan-kawan perdivisi membuat kegiatan kerja bakti dan di saat bulan ramadhan buka bersama. Saya juga mengikuti volunteer berbagi makanan,kegiatannya mengumpulkan donasi terlebih dulu jika sudah tercukupi kita bersama membagi makanan kepada orang-orang kurang mampu ',	1,	1654568336,	NULL,	0),
('SCHLR-NVSPR-d32dd3',	'USR-NVSPR-d45a8',	'Novi Supriani',	'2001-09-12',	'85782224620',	'Jalan Cempaka Raya, RT 010/RW 011, Rawa Buaya, Cengkareng 11740, Jakarta Barat, DKI Jakarta.',	'Ilmu Hukum/Sastra Inggris.',	'Universitas Indonesia/UIN Syar',	'0.00',	'-',	'Nama saya Novi Supriani, anak perempuan dan cucu pertama dari keluarga ayah. Saya berasal dari keluarga yang sangat sederhana. Menjadi anak tertua merupakan tanggungjawab yang cukup berat. Saat ini saya adalah alumni SMAN 96 Jakarta angkatan 2021. Setelah 1 tahun menjalani masa gap year, saat ini saya sedang berjuang untuk berkuliah dan sedang menunggu hasil pengumuman SBMPTN. Pilihan pertama jurusan Ilmu Hukum Universitas Indonesia dan pilihan kedua Sastra Inggris UIN Syarifhidayatullah Jakarta. Pada awal kelulusan SMA, saya sempat menjadi siswi eligible untuk SNMPTN tetapi saya gagal. Lalu saya mencoba lagi melalui jalur SPANPTKIN, SBMPTN dan Jalur mandiri SPMB UIN Jakarta tetapi saya juga kembali gagal berulang kali. Setelah mengalami kegagalan tersebut, saya mencoba untuk mendaftarkan diri di beasiswa Global Millennial Scholarship di bawah naungan perusahaan startup Internasional dan Alhamdulillah saya berhasil menjadi salah satu awardee-nya. Dalam beasiswa tersebut saya belajar banyak hal. Mengikuti program-program pengembangan diri seperti public speaking; MUN; menjadi Brand Ambassador; difasilitasi mentoring oleh para diplomat muda dll. Saya telah merasakan kegagalan berulangkali tetapi saya tau bahwa saya mempunyai tekat yang kuat untuk mencapai cita-cita berkuliah di Perguruan Tinggi Negeri dan menjadi seorang diplomat atau pengacara di masa depan. Saya juga sadar bahwa saya berasal dari keluarga yang sangat sederhana, ingin berkuliah tetapi terhalang oleh biaya. Keluarga tidak mampu membiayai. Tapi hal itu tidak selamanya menyurutkan tekad saya. Saya yakin saya mempunyai potensi jika saya terus berusaha, berdoa serta konsisten untuk mencapainya.',	'Mimpi terbesar saya adalah saya ingin sekali melanjutkan pendidikan ke bangku kuliah, mencapai cita-cita menjadi seorang diplomat atau pengacara. Saya ingin membuktikan pada diri sendiri dan oranglain bahwa saya bisa. Serta membuktikan bahwa perempuan juga berhak mendapatkan pendidikan yang layak dan bisa menjadi seorang pemimpin. Cara saya mewujudkannya adalah saya terus belajar karena ilmu sangatlah luas, meningkatkan soft skills dan personal branding, berusaha mencapai prestasi, mengikuti organisasi dan menjadi wakil ketua dan ketua dari beberapa komunitas.',	'Iya, pernah. Saya pernah menjadi anggota ekstrakurikuler Tari tradisional dan English Club pada saat saya masih SMP, saya pernah menjabat sebagai seorang bendahara di organisasi PASKIBRA dan anggota English Club pada saat saya masih di SMA. Lalu, saya juga pernah menjadi relawan dan menjabat sebagai wakil ketua di sebuah komunitas pendidikan yang bernama Komunitas Ruang serta menjadi mentor di kelas bahasa Inggris dan admin beberapa bahasa yang lain. Saya pernah menjadi Staff Publikasi dan Dokumentasi dari Status Quo Community. Saat ini saya sedang menjabat sebagai ketua di sebuah komunitas bernama Development Zone serta relawan di bagian divisi hukum organisasi Panji Institute.',	1,	1655046531,	NULL,	0),
('SCHLR-NVTFT-92d117',	'USR-NVTFT-d0801',	'Novita Fitrotun Ni\'mah',	'2004-11-21',	'85742373214',	'Karangnongko Nalumsari',	'Pendidikan Agama Islam/Tarbiya',	'Institut Agama Islam Negeri (I',	'0.00',	'1',	'Nama saya Novita Fitrotun Ni\'mah. Saya alumni MA NU Matholiul Huda sebagai lulusan terbaik. Saya suka bergorganisasi dan aktif berkegiatan, saya pernah bergabung dengan organisasi OSIS dan mengikuti ekskul Pramuka di sekolah. \r\n\r\nSaya calon mahasiswa baru di IAIN Kudus yang diterima lewat jalur SPAN-PTKIN 2022',	'Saat menempuh pendidikan saya bertekad menjalani hidup sehat dan produktif, menambah kepercayaan diri, dan menjalin hubungan baik dengan siapapun, mengikuti organisasi kampus/ program lainya, serta bisa memanajemen waktu dengan baik dan lulus tepat waktu dengan IPK yang memuaskan. Setelah lulus dengan gelar yang saya raih, saya berharap bisa mendapat pekerjaan yang baik serta bisa mengamalkan ilmu yang dimiliki dalam kehidupan sehari-hari dan bisa membahagiakan orang tua\r\n\r\nSaya mengikuti program beasiswa ybb untuk memperoleh bantuan atau support biaya perkuliahan saya di perguruan tinggi. Saya ingin meringankan beban ibu saya dalam menyekolahkan saya.\r\n\r\nOleh sebab itu, saya berharap tim beasiswa ybb memberikan saya kesempatan untuk meraih beasiswa yang disediakan. Jika terpilih menjadi penerima beasiswa saya akan menggunakan kesempatan tersebut sebaik mungkin.',	'OSIS (sekretaris)\r\nIPPNU (wakil ketua)\r\nPramuka (seksi acara)',	1,	1654313148,	NULL,	0),
('SCHLR-NWR-f5d7e5',	'USR-NWR-a36c8a',	'Anwar',	'2002-07-28',	'85226452480',	'Padang Mentinggi, Simpang Tonang, Jorong 1, Pasaman, Sumatera Barat',	'Fisika Nk, fakultas Matematika',	'Universitas Negeri Padang',	'3.39',	'2',	'Saya adalah seorang mahasiswa dari Universitas Negeri Padang, berkat kegigihan saya sehingga menghantarkan saya untuk menempuh pendidikan di Universitas Negeri Padang, dan merupakan lulusan terbaik dari sekolah saya, dalam perkuliahan saya Mendapatkan nilai yang memuaskan.\r\nSelain itu motivasi dari orang tua mendorong saya untuk lebih giat dan semangat dalam menyelesaikan S1 saya di Universitas Negeri Padang.',	'Mimpi terbesar saya adalah selain mewujudkan cita-cita, saya juga ingin menjadi orang yang bermanfaat bagi lingkungan dan orang banyak, oleh karena itu, saya mulai dengan belajar sesering mungkin dan diluar jam perkuliahan saya, saya mengikuti berbagai macam seminar yang bisa meningkatkan potensi akademik maupun non akademik saya.',	'Iya, saya merupakan anggota karang taruna di daerah saya, dan tugas dari karang taruna adalah untuk menjaga keamanan dan ketertiban, serta membantu masyarakat yang terkena bencana atau musibah.',	1,	1654059530,	NULL,	0),
('SCHLR-NZHFL-164b56',	'USR-NZHFL-63747',	'Nazhifa Alghina',	'2002-04-30',	'81363270762',	'Jl.Sijunjung III, Siteba, Padang',	'Pendidikan Bahasa Inggris ',	'Universitas Syiah Kuala',	'3.31',	'4',	'Aku adalah seorang mahasiswi akhir semester4. Aku memiliki 2 saudara, 1 adek cowok yang tahun ini akan masuk kuliah dan 1 adek cewek yang duduk di kelas 2 SMP. Awalnya aku tinggal di Padang, hingga pada akhir 2020 papaku meninggal dan umiku memutuskan untuk pindah ke Aceh, tempat umiku berasal. Aku sangat suka mencoba hal-hal baru dan tempat baru. Karna menurutku semua tempat yang aku kunjungi atau akan aku kunjungi pasti memiliki pelajaran dibalik itu semua, pasti terdapat suatu hal yang istimewa. Makanya aku juga sangat suka travelling dan bertemu orang-orang baru.',	'Untuk sekarang mimpi terbesarku adalah membahagiakan umiku. Karna aku sebagai anak pertama juga harus tahu, bahwa hidup ini tidak hanya bergantung pada umiku. Dan aku masih memiliki 2 orang adek yang masih menempuh dunia pendidikan. Aku ingin sekali memberangkatkan umroh keluargaku suatu saat dan tentunya cara untuk mewujudkannya sekrang dengan berdoa. Selain itu, aku juga sangat ingin mendapat beasiswa ke luar negri untuk pendidikan S2. Karna aku tahu, jika memakai biaya sendiri itu tidak akan mampu. Jadi, caranya sekrang aku harus belajar dengan yakin dan sungguh-sungguh dan mengupgrade diri menjadi pribadi yang lebih produktiv.',	'Iya, pertama kali aku terlibat dalam organisasi yaitu saat MAN. Aku masuk OSIS, bidang kominfo. Pengalaman organisasi sangat berpengaruh pada kualitas diri aku. Yang awalnya aku kurang berani atau bisa disebut sering pesimis, di organisasi mau tidak mau aku harus menjadi orang yang berani untuk maju. harus menjadi orang yang optimis, terlebih lagi aku terpilih dalam bidang kominfo yang harus banyak komunikasi dengan orang dan guru-guru disana. Menurutku itu titik awal aku suka berkecimpung dalam organisasi. Saat kuliah aku masuk organisasi himpunan English Student Association. Disana kami pernah mengdakan program  kerja bakti sosial ke pulau breuh, salah satu pulau yang kurang dalam hal pendidikan di aceh. disana kami menjadi relawan 2 hari dalam mengadakan acara untuk anak-anak sd dan sma disana. Aku juga masuk dalam BEM FKIP pada semester 2. aku terpilih dalam divisi agama. Selain itu aku juga masuk dalam Almudarris. ini merupakan lembaga dakwah faultas FKIP. Aku juga masuk dalam UKM Literasi dan Informasi. Dalam UKM ini aku terpilih sebagai anggota divisi sinema.',	1,	1653543477,	NULL,	0),
('SCHLR-NZHRH-b6a238',	'USR-NZHRH-ca038',	'Nazhirah Duanna',	'2003-09-05',	'85358853013',	'Gampong Cot usi',	'Pendidikan Guru Madrasah Ibtid',	'UIN Ar-raniry Banda aceh',	'3.83',	'1',	'Saya bernama Nazhirah duanna, Saya sedang menempuh pendidikan strata satu (S1) di UIN AR-Raniry Banda Aceh, dengan jurusan Pendidikan Guru Madrasah Ibtidaiyah (PGMI) di fakultas Tarbiyah dan keguruan. Setelah lulus nanti saya bercita-cita menjadi entrepreneur atau seorang wirausaha dan tentunya saya juga bercita-cita menjadi seorang pegawai negeri sipil (PNS) seperti yang diidamkan orang tua saya. Oleh karena itu, saya tidak hanya ingin fokus pada bidang akademik saja, melainkan saat aktif perkuliahan tatap muka semester depan (Semester dua)  saya ingin ikut serta dalam beberapa organisasi. Baik itu internal maupun eksternal kampus. Disana saya ingin banyak belajar mengenai bagaimana seharusnya bekerja dalam sebuah tim untuk mencapai tujuan bersama dan meningkatkan rasa solidaritas dan kepedulian saya terhadap masyarakat sekitar yang membutuhkan. \r\n  Dan tentunya saya ingin membahagiakan kedua orang tua saya, dengan cara menjadi seseorang yang sukses, dan menjadi anak yang bisa dibanggakan oleh orang tua. Kesuksesan itu terbilang nomor satu dalam rencana masa depan, jadi saya harus membuang rasa malas dalam diri saya agar kita bisa menjadi orang yang sukses. Harapan-harapan yang ingin saya capai dalam hidup saya setelah lulus kuliah, yaitu : Saya memiliki pekerjaan, membahagiakan orang, menikah, mempunyai bisnis sendiri, melanjutkan pendidikan ke jenjang S2 bahkan S3, ingin keliling dunia dan memiliki aktifitas lain yang bermanfaat. Pendidikan memang tidak bisa menjamin kesuksesan, namun dengan Pendidikan yang tinggi kita akan memiliki banyak pilihan di masa depan.\r\nSaya juga memiliki planning untuk bisa maju dan menciptakan lapangan pekerjaan sendiri bagi orang lain. Karena semakin banyak universitas yang didirikan di Indonesia maka akan semakin banyak pula lulusan-lulusan yang membutuhkan pekerjaan. Opsi pertama yang bisa Saya lakukan setelah selesai kuliah sudah pasti memiliki bekal ilmu yang mumpuni untuk melakukan berbagai aktivitas yang bermanfaat dan bisa menunjang kesuksesan saya. Wirausaha adalah hal yang akan saya lakukan setelah lulus kuliah. Dengan bekal pengalaman dan ilmu yang didapatkan saat kuliah, bisa menjadi modal awal untuk memulai suatu usaha yang meiliki prosepek menjanjikan. Untuk memulai usaha Saya harus memerhatikan usaha apa yang memiliki prospek menjanjikan, kondisi lingkungan, kebutuhan masyarakat dan menyesuaikan dengan modal yang saya miliki. Sudah pasti dengan berwirausaha Saya akan menjadi bos atas usaha saya sendiri.\r\n  Itulah cerita singkat tentang saya.',	'Di sini saya akan menceritakan rencana setelah lulus kuliah. Rencana kedepannya setelah saya lulus kuliah nanti yaitu saya ingin bekerja di sebuah Perusahaan,bisa membuka lapangan pekerjaan sendiri,Saya harus harus memiliki planning untuk bisa maju dan menciptakan lapangan pekerjaan sendri bagi orang lain.Karena semakin banyak universitas yang didirikan di Indonesia maka akan semakin banyak pula lulusan-lulusan yang membutuhkan pekerjaan. rencana lain saya,selain menjadi pengusaha saya pun ingin membahagiakan kedua orang tua saya.dengan cara menjadi seseorang yang sukses, dan menjadi anak yang bisa dibanggakan oleh orang tua. Kesuksesan itu terbilang nomor satu dalam rencana masa depan, jadi saya harus membuang rasa malas dalam diri saya, agar saya bisa menjadi orang yang sukses.Pendidikan memang tidak bisa menjamin kesuksesan, namun dengan Pendidikan yang tinggi akan banyak pilihan di masa depan.setelah lulus,Tentu saja pilihan yang paling utama adalah mencari pekerjaan yang sesuai dengan bidang saya sewaktu kuliah. Saya ingin mencapai itu semua karena saya harus membalas jasa-jasa orang tua Saya.yang telah menyekolahkan saya hingga sarjana. Saya harus memiliki tujuan,saya harus berani keluar dari zona nyaman. Itulah rencana yang ingin saya wujudkan di dalam rekam jejak kehidupan saya. Untuk mewujudkan semua itu di butuhkan usaha dan juga do’a. Tanpa usaha dan do’a semuanya itu akan sia-sia. Sata harap itu semua bukan cuman mimpi-mimpi belaka, tapi menjadi kenyataan. Setidaknya mungkin hanya beberapa dari keinginan saya tersebut akan benar-benar terwujud. Amin ya Allah.',	'Iya, saya pernah mengikuti organisasi ketika saya Sekolah Menengah Atas Yaitu OSIS, dan disitu saya menjadi anggota keagamaan pada saat itu.',	1,	1654065509,	NULL,	0),
('SCHLR-NZTSL-11cf52',	'USR-NZTSL-8aae4',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655741577,	NULL,	0),
('SCHLR-PDLYY-5875cc',	'USR-PDLYY-095c8',	'Padly Yasin Fadillah',	'2003-09-23',	'87708983719',	'Jalan Nakula no 85 Perum Bumi Resik Panglayungan Kecamatan Cipedes Kelurahan Panglayungan Kota Tasikmalaya',	'IPS',	'SMAN 1 Tasikmalaya',	'8.85',	'6',	'Pelajar muda berusia genap 18 tahun yang aktif berperan dalam ke organisasian,kepemimpinan,pengembengan potensi diri,gemar dalam bidang hukum dan sosial,serta memiliki antusiasme tinggi dalam pendalaman ilmu dan pengalaman untuk kemudian di implementasikan dalam kehidupan bermasyarakt serta menjadi inspirasi khalayak khususnya bagi kalangan muda',	'Mimpi saya yakni berkeinginan untuk menjadi seorang pemimpin muda terlebih menjadi pemimpin dalam lingkup politik dan pemerintahan. Alasannya tentu sebagai suatu upaya untuk memberikan pelayanan, pengabdian, serta kontribusi secara nyata dengan penuh kesadaran serta tanggung jawab terhadap masyarakat dalam hal membuat ataupun memutuskan suatu kebijakan sehingga dapat tercapai segala kepentingan dan kebutuhan publik . \r\n\r\nAgar terwujudnya mimpi dan keinginan tersebut, saya sudah mempersiapkan diri dalam mengikuti berbagai macam kegiatan keorganisasian pun lingkup parlemen. Diantaranya, \r\n1. Lolos dan terpilih sebagai perwakilan Jawa Barat dalam kegiatan Parlemen Remaja 2021 Tingkat Nasional yang dilaksanakan secara resmi oleh DPR RI.  \r\n2. Mendapat penghargaan juara 2 tingkat Jawa Barat sebagai Ketua terbaik dalam Forum Pelajar Sadar Hukum dan HAM ( FPSH HAM ) di bawah naungan Kementerian Hukum dan HAM Jawa Barat.\r\n3. Duta Hukum dan HAM Provinsi Jawa Barat\r\n4. Ketua FPSH HAM Kota Tasikmalaya\r\n5. Ketua FOMTAS ( Forum MPK Kota Tasikmalaya ), serta\r\n6. Ketua Komisi C ( MPK di sekolah )\r\n\r\nSekarang, saya pun sedang mengikuti kegiatan seleksi pengabdian untuk acara di Pulau Papua Raja Ampat. Selepas masuk kuliah, saya juga akan mendaftarkan diri untuk menjadi bagian dari BEM maupun HIMA juga akan mengikuti berbagai acara/event kepemimpinan di luar kampus, seperti Acara Ajudan Gubernur, Mentoring, dan bootcamp.\r\n\r\nDengan berbagai pengalaman, penghargaan, serta  rencana yang telah saya sampaikan tersebut, penuh harap agar dapat menjadi jalan ataupun langkah awal saya untuk selanjutnya menggapai mimpi.',	'Pengalaman oganisasi/volunteer yang pernah diikuti :\r\n1. MPK tingkat Sekolah ( Ketua Komisi )\r\n2. MPK tingkat Kota ( Ketua MPK Kota Tasikmalaya ) = Menaungi Seluruh MPK di SMA/SMK di Kota Tasikmalaya\r\n3. FPSH HAM Kota Tasikmalaya ( Ketua Umum ) = Bergerak sebagai motor penggerak dalam meningkatkan kesadaran dan paham hukum pada lingkup pelajar/sekolah tk Kota\r\n4. FPSH HAM Jawa Barat ( Duta Hukum dan Ham ) = Menjadi Role Model/teladan/inspirasi bagi pelajar SMA sederajat dalam hal taat terhadap hukum dan melakukan edukasi serta penyuluhan hukum di lingkungan keluarga, sekolah, serta masyarakat.\r\n5. Parlemen Remaja 2021 DPR RI Tk Nasional ( Finalis mewakili Jawa Barat ) = Simulasi menjadi Anggota Dewan dan diberi pembekalan mengenai bidang politik dan parlementer',	1,	1655626036,	NULL,	0),
('SCHLR-PDLYY-f9ec53',	'USR-PDLYY-a736c',	'Padly Yasin Fadillah',	'2003-09-23',	'87708983719',	'Jalan Nakula no 85 Perum Bumi Resik Panglayungan Kota Tasikmalaya',	'IPS',	'SMAN 1 Tasikmalaya',	'8.85',	'6',	'Pelajar muda berusia kelahiran 2003 yang aktif berperan dalam ke organisasian,kepemimpinan,pengembengan potensi diri,gemar dalam bidang hukum dan sosial,serta memiliki antusiasme tinggi dalam pendalaman ilmu dan pengalaman untuk kemudian di implementasikan dalam kehidupan bermasyarakt serta menjadi inspirasi khalayak khususnya bagi kalangan muda',	'Mimpi saya yakni berkeinginan untuk menjadi seorang pemimpin muda terlebih menjadi pemimpin dalam lingkup politik dan pemerintahan. Alasannya tentu sebagai suatu upaya untuk memberikan pelayanan, pengabdian, serta kontribusi secara nyata dengan penuh kesadaran serta tanggung jawab terhadap masyarakat dalam hal membuat ataupun memutuskan suatu kebijakan sehingga dapat tercapai segala kepentingan dan kebutuhan publik . \r\n\r\nAgar terwujudnya mimpi dan keinginan tersebut, saya sudah mempersiapkan diri dalam mengikuti berbagai macam kegiatan keorganisasian pun lingkup parlemen. Diantaranya, \r\n1. Lolos dan terpilih sebagai perwakilan Jawa Barat dalam kegiatan Parlemen Remaja 2021 Tingkat Nasional yang dilaksanakan secara resmi oleh DPR RI.  \r\n2. Mendapat penghargaan juara 2 tingkat Jawa Barat sebagai Ketua terbaik dalam Forum Pelajar Sadar Hukum dan HAM ( FPSH HAM ) di bawah naungan Kementerian Hukum dan HAM Jawa Barat.\r\n3. Duta Hukum dan HAM Provinsi Jawa Barat\r\n4. Ketua FPSH HAM Kota Tasikmalaya\r\n5. Ketua FOMTAS ( Forum MPK Kota Tasikmalaya ), serta\r\n6. Ketua Komisi C ( MPK di sekolah )\r\n\r\nSekarang, saya pun sedang mengikuti kegiatan seleksi pengabdian untuk acara di Pulau Papua Raja Ampat. Selepas masuk kuliah, saya juga akan mendaftarkan diri untuk menjadi bagian dari BEM maupun HIMA juga akan mengikuti berbagai acara/event kepemimpinan di luar kampus, seperti Acara Ajudan Gubernur, Mentoring, dan bootcamp.\r\n\r\nDengan berbagai pengalaman, penghargaan, serta  rencana yang telah saya sampaikan tersebut, penuh harap agar dapat menjadi jalan ataupun langkah awal saya untuk selanjutnya menggapai mimpi.',	'Pengalaman oganisasi/volunteer yang pernah diikuti :\r\n1. MPK tingkat Sekolah ( Ketua Komisi )\r\n2. MPK tingkat Kota ( Ketua MPK Kota Tasikmalaya ) = Menaungi Seluruh MPK di SMA/SMK di Kota Tasikmalaya\r\n3. FPSH HAM Kota Tasikmalaya ( Ketua Umum ) = Bergerak sebagai motor penggerak dalam meningkatkan kesadaran dan paham hukum pada lingkup pelajar/sekolah tk Kota\r\n4. FPSH HAM Jawa Barat ( Duta Hukum dan Ham ) = Menjadi Role Model/teladan/inspirasi bagi pelajar SMA sederajat dalam hal taat terhadap hukum dan melakukan edukasi serta penyuluhan hukum di lingkungan keluarga, sekolah, serta masyarakat.\r\n5. Parlemen Remaja 2021 DPR RI Tk Nasional ( Finalis mewakili Jawa Barat ) = Simulasi menjadi Anggota Dewan dan diberi pembekalan mengenai bidang politik dan parlementer',	1,	1655295155,	NULL,	0),
('SCHLR-PLTDT-bc49ce',	'USR-PLTDT-43079',	'Pelita Dita Elsanti',	'2003-01-03',	'89630174766',	'Jl. Bintara IV Rt.004/001 No. 29 Bekasi Barat, Kota Bekasi',	'Pendidikan Agama Islam',	'UIN Prof. K. H. Saifuddin Zuhr',	'3.67',	'4',	'Perkenalkan, saya Pelita Dita Elsanti mahasiswi UIN Prof. K. H. Saifuddin Zuhri Purwokerto mengambil prodi Pendidikan Agama Islam. Dikampus, saya sering berjualan nasi bakar dengan harga Rp.5.000,- memang tidak untung banyak, tetapi lumayan untuk makan sehari-hari anak kost. \r\nDan disini saya mendapatkan banyak pengalaman organisasi, saya mengikuti salah satu organisasi lembaga pers mahasiswa yang dimana ditempat ini saya mempelajari banyak hal seperti menulis berita, meliput, dsb. ',	'Membanggakan orang tua. Dengan saya terus belajar, menggapai harapan yaitu membanggakan orang tua. Kuliah tepat waktu dan jika masih diberikan kesempatan saya akan melanjutkan ke jenjang selanjutnya seperti S2, S3. ',	'Banyak sekali saya mengikuti organisasi karena apa? Karena saya ingin menambah relasi yang sangat banyak. juga dengan saya mengikuti organisasi, saya bisa mengerti apa jati diri saya, dimanakah diri saya ditempatkan, apa hobby saya misalkan, nah dengan mempunyai banyak pengalaman organisasi saya bisa mengenal diri saya dan bakat terpendam saya. ',	1,	1654003770,	NULL,	0),
('SCHLR-PNLHM-74b2be',	'USR-PNLHM-e601c',	'Pinulih Mulqi Anisawenda',	'2003-07-10',	'82372069794',	'Blok 04 Jalur 54 No. 04 RT 002/RW 006 Bumi Dipasena Agung, kec. Rawajitu Timur, kab. Tulang Bawang, prov. Lampung ',	'Pendidikan Bahasa dan Seni/Pen',	'Universitas Lampung ',	'3.89',	'2',	'Saya adalah mahasiswi berprestasi, namun kurang mampu. Saya beberapa kali mendapat medali perunggu, perak, dan menjuarai berbagai perlombaan baik di bidang akademik maupun non akademik. Saya berasal dari keluarga berekonomi rendah. Ayah saya seorang petani sedangkan ibu saya seorang ibu rumah tangga. Saya memiliki tekad yang kuat untuk terus belajar dan melanjutkan studi saya walaupun terhalang faktor finansial. Maka saya apply beasiswa ini untuk membantu meringankan beban orang tua terkait biaya kuliah saya, mengasah bakat, dan meng-upgrade skill sehingga saya dapat menggapai cita-cita.',	'Mimpi terbesar saya adalah menjadi seorang pendidik, penulis best seller, musisi, dan pengusaha sukses yang dapat membanggakan kedua orang tua. Cara saya untuk mewujudkannya di antaranya saat ini saya sedang menempuh kuliah dengan sungguh-sungguh di Fakultas Pendidikan yang mana nantinya saya akan menjadi seorang guru/pendidik/pengajar. Selain itu, saya juga sering mengasah kemampuan bernyanyi dan menulis saya melalui ajang-ajang atau perlombaan. Saya pernah menjuarai lomba menyanyi dan beberapa tulisan saya juga dimuat dalam buku antologi ber-ISBN. Saya masih aktif menulis di laman blog dan wattpad untuk menuangkan pikiran dan perasaan saya. Saya juga sedang mencoba mendesain sebuah business plan untuk saya apply beberapa waktu yang akan datang.',	'Semenjak duduk di bangku Madrasah Aliyah, saya sudah mengikuti organisasi setara OSIS. Saat itu saya menjabat sebagai anggota bagian Ketertiban periode 2019/2020. Tugas saya berupa mengamankan dan menertibkan seisi pesantren agar tetap kondusif. Sekarang setelah lulus, saya kuliah di Perguruan Tinggi Negeri. Saya mengikuti 2 organisasi, yaitu Imabsi Unila sebagai anggota bagian Kerohanian dan FPPI FKIP Unila sebagai anggota bagian Kemediaan Islam periode 2021/2022. Di bagian Kerohanian, saya diamanahi untuk menjadi penanggung jawab dalam membuat Siaran Motivasi setiap pekan. Sedangkan di bagian Kemediaan Islam, saya bertugas mengolah media atau mengelola informasi di platform organisasi tersebut. Selain itu, saya juga aktif dalam berbagai acara kepanitiaan.',	1,	1655392951,	NULL,	0),
('SCHLR-PRDN-5f7518',	'USR-PRDN-d08403',	'PIRDAN',	'2002-05-05',	'85311419182',	'Jl. Marinjung Girang',	'Teknologi dan Manajemen Perika',	'IPB University',	'3.29',	'2',	'Baik, terimakasih atas kesempatannya, perkenalkan saya PIRDAN mahasiswa semester 2 fakultas Perikanan dan Ilmu Kelautan departemen Teknologi dan Manajemen Perikanan Budidaya IPB University, saya berasal dari pelabuhanratu Sukabumi Jawa barat, saya tipe orang yang pantang menyerah, walupun cobaan begitu berat insyaallah dapat saya lalui, bertanggung jawab atas amanah yang dipegang itu jati diri saya, dan saya orang yang disiplin, baik itu dalam waktu maupun dalam lain hal.',	'Mimpi terbesar saya yaitu menjadi seorang menteri kelautan dan perikanan. Dimana saya itu Indonesia merupakan negara namun pengelolaan sumberdaya nya yang kurang optimal, maka dari itu saya belajar untuk menggapai mimpi saya, membanggakan Nusa bangsa, dan demi terwujudnya sustainable development goals 2030.',	'Ya, saya menjabat sebagai staf internal dan eksternal di salah satu unit kegiatan mahasiswa yaitu tenis lapang IPB University, selain itu saya pernah menjadi panitia IGTS ( IPB Goes To School ), dan menjadi anggota beberapa unit kegiatan mahasiswa seperti koperasi mahasiswa IPB University, IPB archery, dan badminton IPB University.',	1,	1653742926,	NULL,	0),
('SCHLR-PRDN-afc044',	'USR-PRDN-d08403',	'PIRDAN',	'2002-05-05',	'85311419182',	'Jl. Marinjung Girang',	'Teknologi dan Manajemen Perika',	'IPB University',	'3.29',	'2',	'Baik, terimakasih atas kesempatannya, perkenalkan saya PIRDAN mahasiswa semester 2 fakultas Perikanan dan Ilmu Kelautan departemen Teknologi dan Manajemen Perikanan Budidaya IPB University, saya berasal dari pelabuhanratu Sukabumi Jawa barat, saya tipe orang yang pantang menyerah, walupun cobaan begitu berat insyaallah dapat saya lalui, bertanggung jawab atas amanah yang dipegang itu jati diri saya, dan saya orang yang disiplin, baik itu dalam waktu maupun dalam lain hal.',	'Mimpi terbesar saya yaitu menjadi seorang menteri kelautan dan perikanan. Dimana saya itu Indonesia merupakan negara namun pengelolaan sumberdaya nya yang kurang optimal, maka dari itu saya belajar untuk menggapai mimpi saya, membanggakan Nusa bangsa, dan demi terwujudnya sustainable development goals 2030.',	'Ya, saya menjabat sebagai staf internal dan eksternal di salah satu unit kegiatan mahasiswa yaitu tenis lapang IPB University, selain itu saya pernah menjadi panitia IGTS ( IPB Goes To School ), dan menjadi anggota beberapa unit kegiatan mahasiswa seperti koperasi mahasiswa IPB University, IPB archery, dan badminton IPB University.',	1,	1653742982,	NULL,	0),
('SCHLR-PRHDM-9dbece',	'USR-PRHDM-2fe21',	'Prihadi Mulya Pradana',	'2002-01-29',	'83857673043',	'Dusun Jeruk Porot, Batang-Batang Daya',	'Teknik Mesin',	'Politeknik Negeri Malang',	'3.50',	'3',	'Saya ingin menambah ilmu pengetahuan tentang dunia teknologi dan pengalaman baru ',	'Saya bermimpi ingin menjadi seorang under welding water dan menempuh pendidikan kuliah di luar negeri ',	'Saya pernah masuk organisasi tentang pendidikan dan penalaran sekarang masuk autron kontes mobil hemat energi',	1,	1654453150,	NULL,	0),
('SCHLR-PRHDM-ff87fc',	'USR-PRHDM-2fe21',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654452948,	NULL,	0),
('SCHLR-PRMTH-a93494',	'USR-PRMTH-feac9',	'Paramitha Hikmah Rimaningtyas',	'2003-01-18',	'085225194375',	'Jln Raya No 650 Petarukan, RT.005/RW.006, Kab. Pemalang, Jawa Tengah',	'Manajemen/Fakultas Ekonomika d',	'Universitas Diponegoro',	'3.70',	'2',	'Saya adalah tipe anak yang aktif, percaya diri, pantang menyerah, tegas, mudah bergaul, dan ramah. Hobi saya adalah membaca buku dan bersepeda.',	'Mimpi terbesar saya adalah ingin menjadi mahasiswa yang berprestasi, menjadi lulusan terbaik UNDIP, mendapat pekerjaan yang saya impikan. Cara yang saya lakukan untuk mewujudkannya adalah dengan fokus dengan apa yang sedang dikerjakan, tetap berlatih, berdoa.',	'Iya. Saya mengikuti organisasi dari SMP. Di SMP saya pernah mengikuti OSIS, dan saya terpilih menjadi Wakil Ketua OSIS. Lalu di SMA saya mengikuti PKS dan Pramuka. Dari mengikuti organisasi, saya mendapatkan pengalaman yang banyak. Di organisasi sangat dilatih mentalnya, dilatih kedisiplinan, dan tahu arti kebersamaan. Dari berorganisasi, jadi bisa mendapatkan kejuaraan dari beberapa perlombaan.',	1,	1654275936,	NULL,	0),
('SCHLR-PRNNR-793f44',	'USR-PRNNR-9ed24',	'Apriani Nur Raina',	'2001-04-22',	'82352727521',	'Dungus RT 15, Karanganyar, Plupuh, Sragen, Jawa Tengah',	'Sistem InformasiFakultas Rekay',	'Telkom University',	'3.71',	'4',	'Saya apriani nur raina mahasiswa Telkom university jurusan system informasi semester 4, saya berasal dari sragen jawa tengah. Selama saya kuliah saya aktif mengikuti kegiatan lab, bootcamp, komunitas, internship dan pernah menjadi asisten dosen. Alasan saya mengikuti kegiatan” tersebut karena ingin mengembangkan softskill dan hardskill sebelum nantinya terjun kedunia kerja. Kelebihan saya yaitu saya orang yang bertanggungjawab dan disiplin, dengan berbagai kegiatan yang sudah saya ikuti, saya melaksanakan tugas” tersebut dengan sebaik mungkin dan selalu konsisten untuk mengerjakan tepat waktu. Namun saya juga memiliki kekurangan, salah satunya Sulit menyeimbangkan work life balance. Ketika kegiatan antara kuliah dengan organisasi atau lab memiliki acara yang bersamaan pasti saya membutuhkan energy ekstra untuk bisa menyelesaikan semua pekerjaan tepat pada waktunya dan akhirnya saya lupa waktu untuk istirahat, pergi berlibur, atau melakukan hobi yang saya sukai. Dan untuk mengatasi masalah tersebut saya membuat strategi dengan membuat schedule secara rinci dengan membedakan kegiatan yang penting mendesak, penting tdk mendesak, tdk penting tdk mendesak',	'mimpi terbesar saya adalah bisa mendapatkan beasiswa kuliah s2 ke jepang. cara saya mendapatkan impian tersebut adalah dengan berusaha memenuhi persyaratan beasiswa dari sekarang dan mulai mencari informasi terkait beasiswa, selain itu saya juga harus memiliki koneksi dari alumni atau mahasiswa yang sudah berkuliah dijepang untuk mempermudah saya dalam mendapatkan beasiswa. setelah usaha saya juga harus selalu berdoa kpd tuhan agar rencana yang sya buat terpenuhi',	'saya memiliki pengalaman organisasi sejak saya masih duduk dibangku sma. saya mengikuti palang merah remaja dan memiliki tanggungjawab sebagai sie hubungan masyarakat. dari jabatan tersebut saya mulai aktif menjadi panitia lomba tingkat kabupaten dan provinsi. ketika saya kuliah saya mulai aktif juga mengikuti organisasi seperti just code it yang berfokus pada bidang pemrograman',	1,	1653971399,	NULL,	0),
('SCHLR-PSPTD-ae6661',	'USR-PSPTD-b462a',	'PUSPITA ADIRIANI',	'2002-07-24',	'82336885695',	'Dusun Plumpang, RT 03 RW 04, Desa Plumpang, Kecamatan Plumpang, Kabupaten Tuban, Jawa Timur.',	'Ekonomi Islam',	'Universitas Airlangga',	'3.5',	'1',	'Saya suka membaca buku sekurang-kurangnya dalam sehari saya bisa menghabiskan 2-3 buku, saya memiliki tipe ambisius dalam mengejar cita-cita saya. Tiada hari tanpa belajar itu menurut saya seperti hidup tanpa tujuan. ',	'Mimpi terbesar saya yakni menjadi dosen dan bisa melanjutkan pendidikan S2 maupun S3 saya diluar negeri. Perguruan tinggi luar negeri yang saya inginkan yakni stanford dan harvard. Untuk mewujudkan mimpi saya, saya akan belajar lebih giat lagi, membaca buku lebih banyak lagi, ikut webinar, mendaftar beasiswa, belajar tofl, belajar materi di perkuliahan, lulus cumlaude, belajar sedikit demi sedikit materi tes luar negeri agar lulus tes perguruan tinggi diluar negeri suatu saat nanti, ikhtiar, meminta restu orang tua,',	'pengalaman organisasi saya di ECC(english club course). Disana saya banyak belajar akan relasi, cara pengucapan bahasa inggris yang benar, cara menulis bahasa inggris yang benar, menyenangkan, tidak terlalu monoton akan materi saja, memberi saya banyak pengalaman yang dapat membuat saya lebih baik lagi akan progres ke depannya dalam meraih cita-cita.',	1,	1654425626,	NULL,	0),
('SCHLR-PTDVS-06ed6c',	'USR-PTDVS-5c8ff',	'Putu Devi Savitri',	'2007-07-21',	'81220561593',	'Jln. Kartini no 87/91 Denpasar Bali',	'IPS',	'SMA N 1 Denpasar',	'0.00',	'1',	'Saya Putu Devi Savitri,  bisa dipanggil Devi. Bulan ini saya akan menjadi siswa SMA di SMA N 1 Denpasar, dan juga saat ini saya berumur 14 tahun.  Karena adanya  pandemic Covid-19 ini  mengharuskan saya  untuk bersekolah secara online,  sehingga saya, memiliki banyak waktu luang,  yang   saya manfaatkan untuk melakukan, serta mencoba banyak hal-hal positif. Kegiatan yang saya lakukan adalah, seperti ikut berpartisipasi  dalam  beberapa  organisasi internasional  maupun nasional, seperti menjadi seorang campus ambassador dari International MUN, brand ambassador dari Eduship Forum, Maju Indonesia serta saya juga menjadi seorang co-founder dari National Youth Millennial ( NYM ).  Selain itu saya juga mengikuti berbagai kompetisi, khususnya di bidang IPA, IPS dan Bahasa Inggris, serta saya juga meraih beberapa mendali dari kompetisi- kompetisi yang saya ikuti, diantaranya adalah saya meraih mendali perunggu pada kompetisi biologi tingkat SMA yang diadakan oleh science Olympiad in Nusantara 2020, medali emas pada kompetisi biologi dan kimia yang diadakan oleh Denpasar Mengajar Competition, meraih mendali perunggu ( honorable ) rank 32 pada kompetisi science yang diadakan oleh ASEAN Student Science Olympiad 2021, mendali perak pada kompetisi Indonesia Student Science Competition 2021di bidang IPA, mendali perak pada kompetisi News Junior Olypiad di bidang Bhasa Inggris  dan meraih mendali emas pada kopetisi National Young Olympic 2021 di bidang IPS .',	'Saya ingin menjadi orang yang sukses, saya ingin bisa membangun suatu organisasi dan company yang  berfokus diluar sekolah formal, seperti dapat membantu untuk mengasah sof skils, yang dapat membantu banyak teman teman pelajar dalam menggapai cita cita mereka, dan dimana hal tersebut dapat menjadi wadah atau tempat untuk kita para pelajar untuk saling bertukar pikiran, ide, serta pengalaman, dan juga dapat melatih kita semua dalam melatih skill teamwork kita, dan dapat maju bersama – sama. Oleh sebab itu, mulai dari sekarang saya memanfaatkan waktu luang saya untuk mencoba banyak hal,dan  melakukan kegiatan kegiatan positif, seperti ikut serta dalam berbagai organisasi, ikut berpartisipasi dalam kegiatan beasiswa, lomba serta saya yakin jika kita memiliki niat yang tulus, pasti apa pun yang kita cita citakan akan terwujud.',	'Iya, saya memiliki pengalaman organisasi . saya mulai ikut berpartisipasi dalam organisasi di tahun 2021 kemaren, saya menjadi official campus ambassador dari International MUN, dilanjutkan ikut berpartisipasi menjadi ambassador di Eduship Forum 2.0, lalu di lanjutkan dengan saya bergabung bersama teman teman saya untuk membuat komunitas, yaitu National Youth Millennial ( NYM ). NYM adalah sebuah komunitas yang dibangun oleh para awardee Global Millennial  Scholarship by Global Millennial Group, yang bertujuan untuk mengajak  para millennials Indonesia menjadi millennials yang berproduktif, serta ingin membantu para millennials dalam mengembangkan potensi diri yang dapat membantu dalam membangun Indonesia Emas 2045. Serta saat ini, saya juga  terpilih menjadi salah satu ambassador di Youthped.Id.',	1,	1655111133,	NULL,	0),
('SCHLR-PTRDL-2e42cb',	'USR-PTRDL-31de7',	'Putri Adila Agustina',	'2004-08-10',	'83172731435',	'Jalan Pasundan RT 4 RW 1, Kel. Sumber Jaya, Kec. Kampung Melayu',	'Farmasi',	'Universitas Bengkulu',	'9.0',	'1',	'Saya baru saja menyelesaikan pendidikan SMA saya di MAN 1 Kota Bengkulu. Sekarang, saya akan melanjutkan pendidikan di Universitas Bengkulu dengan prodi D3 Farmasi. Selama bersekolah, saya aktif dalam mengikuti berbagai kompetisi dan organisasi. Saya memiliki rasa ingin tahu yang tinggi dan suka mencoba hal-hal baru.',	'Mimpi terbesar saya adalah dapat menjadi seorang ahli farmasi yang dapat menemukan obat yang dapat menyembuhkan berbagai penyakit yang sampai sekarang belum ditemukan obatnya, salah satunya kanker. Dengan itu, saya dapat membantu banyak orang dan memberikan harapan terhadap pasien agar dapat sembuh. Cara saya mewujudkannya adalah dengan belajar sungguh-sungguh dan giat, yaitu dengan sekolah jurusan Farmasi. Di sana, nantinya saya akan belajar hal-hal yang berkaitan dengan farmasi dan mempraktikkannya. Hal tersebut menjadi dasar bagi saya untuk mewujudkan mimpi terbesar saya dan dapat membantu saya dalam mewujudkan mimpi terbesar saya.',	'Selama bersekolah, saya pernah menjadi pengurus dalam organisasi. Saya menjadi pengurus Biologi Club saat kelas X dan XI. Saya juga menjadi pengurus Kimia Club saat kelas XII. Di sana, saya bertanggungjawab dalam mempromosikan atau mengenalkan Kimia Club kepada siswa-siswi agar tertarik untuk dengan Kimia Club. Tugas lainnya adalah mendata para anggota, memberikan arahan kepada anggota baru, dan menyampaikan pendapat atau saran para anggota kepada pembina. Selain itu, saya juga diberikan amanat untuk membantu mencari bahan atau materi yang akan dibahas dalam pertemuan selanjutnya. \r\n\r\nOrganisasi lainnya yang pernah saya ikuti adalah RISMA atau Remaja Islam Masjid Nurul I\'lmi MAN 1 Kota Bengkulu, Robotic Cimanuk Club, English Club, dan Mandarin Club. ',	1,	1655735811,	NULL,	0),
('SCHLR-PTRDT-5b945c',	'USR-PTRDT-09bf1',	'Putri Dita Nurkholipah Al Wahidi',	'2000-04-19',	'89505105926',	'Jl Raya Cifor No.68 03/01 Bubulak Bogor Barat',	'Manajemen',	'Universitas Siber Asia',	'3.84',	'3',	'Saya seorang mahasiswa semester 3 jurusan manajemen di Universitas Siber Asia. Sebelumnya saya menempuh pendidikan D1 jurusan Adm Perkantoran. Saya adalah orang yang sangat suka dengan hal-hal yang baru dan suka untuk mempelajarinya, tidak pantang menyerah, tekun dan gigih.',	'Mimpi terbesar jangka pendek saya adalah segera mendapatkan pekerjaan  tetap agar bisa membiayai kuliah dengan uang saya sendiri dan sedikit membantu perekonomian keluarga. Cara saya mewujudkanya adalah, saat ini saya berusaha untuk melamar pekerjaan ke berbagai tempat sambil menjalankan perkuliahan dan menambah wawasan dan skill.',	'Saya pernah menjadi internship di Kompas Muda sebagai Reporter selama 3 bulan. Saya lolos menjadi internship disana dengan melewati tahapan seleksi berkas yang dimana saya mengirim karya saya yang berupa essay mengenai rokok dan berhasil lolos melewati tahap wawancara. Selama 3 bulan internship disana saya diperkenalkan dengan dunia jurnalistik dan proses pencetakan juga penerbitan sebuah berita. Selain itu saya juga mengikuti organisasi lingkungan yaitu Earth Hour Bogor, youth act  for indonesia, Bogor ngariung, dll.',	1,	1653585942,	NULL,	0),
('SCHLR-PTRJY-1836e1',	'USR-PTRJY-bf02d',	'Putri Jayanti Nursafitri',	'2002-01-14',	'8389112529',	'Jl Durian 1 no 11, Pondok Makmur, Tangerang, Banten.',	'Ilmu Komunikasi',	'Univ. Diponegoro',	'3.57',	'4',	'Saya Putri, mahasiswi semester 4 jurusan Ilmu Komunikasi. Saya pribadi yang ekstrovert itulah salah satu alasan mengapa saya memilih jurusan Ilmu Komunikasi, saya senang berinteraksi dengan banyak orang. Saya mudah beradaptasi dengan lingkungan baru, karna itulah saya memiliki keinginan untuk menjadi seorang PR. Disamping itu, saya juga pribadi yang mau mencoba hal baru, dimana ketika saya suka membaca novel, saya mencoba untuk membuat cerita pendek hasil imajinasi di buku catatan saya, meskipun cerita tersebut tidak sebagus atau seprofesional seorang penulis, tapi saya suka ketika saya menuangkan apa yang saya pikirkan kedalam tulisan itu. Saya juga mudah bekerja secara berkelompok, hal tersebut dibuktikan dengan tugas kuliah yang selesai tepat waktu bersama rekan-rekan saya.',	'Saya bermimpi untuk menjadi independent woman yang sukses, saya memulai mimpi saya dengan mencoba menanamkan keyakinan dalam diri saya bahwa ketika saya berusaha dengan baik, maka akan ada hasil baik pula yang saya dapatkan, saya mencoba belajar dengan lebih giat lagi meskipun terkadang lelah dan goyah di tengah jalan, terkadang di beberapa kesempatan juga saya mengikuti kegiatan untuk meningkatkan skill secara online.',	'Saya pernah menjadi ketua Pusat Informasi Konseling Remaja (PIK-R) selama kurang lebih 2 tahun ketika di SMP yang di bimbing oleh guru BK saya, Saya diajarkan untuk melatih public speaking saya dan juga diajarkan untuk menjadi seorang pendengar yang baik ketika mendengarkan permasalahan orang lain.\r\nSaat SMA saya mengikuti organisasi Musyawarah Perwakilan Kelas (MPK), sebagai anggota Komisi II yang memiliki tugas untuk mengawasi setiap kinerja OSIS.\r\nSaat ini, saya mengikuti organisasi di luar kampus yakni Future Leader Summit (FLS) sebagai anggota divisi LIason Officer yang bertugas mencari dan menghubungi Speaker.',	1,	1653744020,	NULL,	0),
('SCHLR-PTRKM-959ce7',	'USR-PTRKM-e99eb',	'Putri Kamila Bilqis',	'2002-04-10',	'81331458396',	'RT.001/RW.002 LASEM, SIDAYU, GRESIK 61153',	'S1 Manajemen/Fakultas Ekonomi ',	'Universitas Jember',	'3.62',	'4',	'Saya merupakan anak pertama dari 2 bersaudara, sedang menempuh di semester 4 universitas Jember. Ayah saya meninggal waktu saya kelas 6 SD, sehingga setelahnya, ibu saya menggantikan untuk kerja banting tulang untuk menghidupi kami bertiga. Bahkan kami pernah di posisi terendah dalam hidup kami, untuk makan saja hanya cukup untuk hari ini, tidak tahu untuk hari berikutnya. Namun pada saat pendaftaran kuliah, Alhamdulillah saya masuk dengan jalur SNMPTN, besar harapan saya untuk terus kuliah dan menyelesaikannya dalam waktu yang cepat agar bisa membantu meringankan beban ibu saya dan membantu membiayai sekolah adik saya.',	'Mimpi terbesar saya, saya ingin mengembangkan usaha yang kami miliki, dari usaha kecil-kecilan menjadi usaha yang besar dan sukses. Saya juga berharap dan berusaha menyelesaikan kuliah saya tepat waktu agar bisa membiayai sekolah adik saya.',	'Saya pernah bergabung di beberapa organisasi di sekolah maupun di kampus, mulai dari UKM, OSIS, KKR (kader kesehatan remaja), dll.\r\nNamun untuk saat ini saya fokus pada kuliah saya',	1,	1655704875,	NULL,	0),
('SCHLR-PTRKR-d89c0b',	'USR-PTRKR-de65d',	'putri kurnia',	'2002-11-02',	'895359694060',	'Jalan depati barin',	'Fakuktas Ilmu sosial dan Ilmu ',	'Universitas Sriwijaya',	'3.90',	'2',	'Saya merupakan mahasiswa jurusan administrasi publik semester 2 universitas sriwijaya. Saya punya passion di bidang sosial maupun politik, saya suka belajar bahasa inggris dan public speaking. saya menyukai tantangan dan mencoba hal-hal baru. ',	'Saya mempunyai mimpi ingin melanjutkan pendidikan diluar negeri, saya berencana untuk mencari beasiswa yang bisa mencakup biaya pendidikan saya disana.',	'Ya punya, di kampus saya mengikuti beberapa organisasi seperti himpunan mahasiswa dan BEM. Dibeberapa kesempatan saya turut berpartisipasi menjadi panitia dalam acara-acara yang diselenggaraan kampus ',	1,	1653540439,	NULL,	0),
('SCHLR-PTRLF-f3e27b',	'USR-PTRLF-56179',	'Putri Alifyha',	'2002-03-31',	'82215538152',	'Indonesia, Sulawesi Tengah, Palu, Jalan Tanjung satu',	'Pendidikan Agama Islam/Tarbiya',	'Universitas Islam Negeri Datok',	'3.86',	'2',	'Saya merupakan anak pertama perempuan yang lahir dari keluarga sederhana. Mempunyai mimpi besar untuk sekolah setinggi-tingginya agar dapat mengangkat derajat kedua orang tua saya. Saya kuliah di salah satu Universitas di kota Palu. Saya suka belajar, apalagi menulis dan memperindah tulisan saya. Saya suka mencoba hal-hal baru yang dapat menambah pengalaman serta wawasan saya. Saya juga sangat suka bersosialisasi, mengikuti kegiatan kegiatan organisasi atau kegiatan relawan. Publik Speaking adalah hal yang sangat ingin saya kuasai dan menjadi seorang tenaga pengajar atau guru yang baik adalah impian saya.',	'Mimpi terbesar saya, saya sangat ingin menjadi seorang guru. Karena dari gurulah dunia bisa berubah ',	'Ya tentu, saya punya banyak pengalaman dalam berorganisasi. Seperti saat saya berada di Sekolah Dasar saya mengikuti organisasi Pramuka, dimana saya diajarkan baris berbaris, diajarkan mengenal alam dan lain sebagainya. Ketika saya SMP saya mengikuti organisasi Patroli Keamanan Sekolah, dari ekskul itulah saya dapat merasakan bagaimana tanggung jawab besar menjadi seorang polisi, seorang keamanan, dan kedisiplinan. Kemudian lanjut SMA saya mengikuti 2 organisasi, yang pertama organisasi keagamaan biasa disebut Remaja Masjid, karena semakin dewasa kita harus semakin mengenal Tuhan kita dan harus menjadi lebih baik. Organisasi kedua yaitu Palang Merah Remaja, dari organisasi inilah saya mengenal namanya nilai nilai kemanusiaan, bagaimana kita menolong seseorang, bagaimana kita menghadapi situasi dalam keadaan bencana, perang, dan bagaimana orang awam yang ingin membantu ketika ada orang sakit, mempelajari ilmu kedokteran dan lain sebagainya. Nah setelah saya lulus SMA, saya masih melanjutkan kegiatan kemanusiaan saya, dengan mendaftar dan menjadi salah satu relawan aktif di Palang Merah Indonesia yang berada di kota Palu.',	1,	1653835080,	NULL,	0),
('SCHLR-PTRMH-8258f9',	'USR-PTRMH-7cc85',	'Putri maharani',	'2003-04-28',	'82184346593',	'Jl. Citarum II, rt/rw 06/02, kel. Cipayung, kec. Ciputat, kab. Tangerang selatan, banten, Indonesia. ',	'Hukum keluarga / Syariah dan H',	'Univeristas Syarif Hidayatulla',	'3.61',	'2',	'Selamat malam\r\n\r\nSebelumnya perkenalkan nama saya putri maharani biasa dipanggil rani, saya lahir di ibu kota jakarta pada tanggal 28 April 2003 Dan sekarang umur saya menginjak 19 tahun, saya sekarang sedang melanjutkan study saya di perguruan tinggi UIN Syarif Hidayatullah Jakarta, untuk meraih gelar strata 1. Saya merupakan anak terakhir dari 5 bersaudara. Selepas sd saya dididik dan dirawat hanya  oleh ayah saya, Allah lebih sayang kepada ibu saya. Meskipun Salah satu orang tersayang Yang sangat berharga bagi saya telah pergi meninggalkan saya, akan tetapi saya tetap berusaha untuk bangkit menjalani hidup karena saya berpikir masih ada satu orang Yang sangat berharga dalam hidup saya Yang harus saya bahagiakan dan saya banggakan dan itu adalah ayah saya. Itulah Yang menjadi acuan saya untuk semangat dalam menjalani hidup. Melihat kegigihan ayah saya, bekerja kesana kemari untuk membiayai saya kuliah, membuat saya ingin semakin berusaha mendapatkan beasiswa karena dengan cara seperti inilah saya dapat meringankan beban ayah saya. \r\n\r\nSaya juga awalnya adalah seorang pelajar Yang bisa dikatakan introvert dan belum memiliki kepercayaan diri. Tetapi itu semua tidak membuat saya putus asa, saya mencoba berusaha untuk menjadi seorang manusia Yang tumbuh dan berkembang. Agar saya dapat merealisasikan mimpi terbesar saya dalam hidup saya. Yakni menjadi insan Yang bermanfaat bagi diri sendiri, keluarga, masyarakat, bangsa dan negara. ',	'Mimpi terbesar saya, ingin menjadi orang Yang bermanfaat bagi orang banyak, jika dilihat dari kalimat tersebut mungkin itu bukan lah sebuah mimpi Yang besar, maka dari itu don\'t judge book by the cover but lihatlah makna Yang terdapat didalamnya jika kita dapat bermanfaat bagi Salah satu orang maupun lebih, orang Yang ada dinegara ini baik dalam memberikan motivasi hidup dan lain sebagainya, kemudian orang-orang tersebut dapat mengembangkan diri, berusaha dan berhasil wewujudkan kesuksesan, bukankah ini akan menjadi sebuah kemajuan tersendiri bagi negara tercinta kita ini. Karena semakin banyak orang orang berkualitas Yang terlahir di negara ini maka pasti akan semakin berkualitas pula negara tercinta kita ini. Dan cara saya mewujudkan hal tersebut dengan cara mengikuti berbagai organisasi relawan Salah satunya, serta mengikuti webinar maupun beasiswa agar kelak saya dapat menyampaikan pengalaman saya dan membagikannya ke orang banyak agar kelak dapat menjadi sebuah acuan semangat ataupun motivasi bagi anak-anak baru di negara ini. ',	'Ya, Disaat saya berada di bangku sekolah Madrasah Aliyah saya menjadi Salah satu anggota organisasi atau disingkat ospita ( organisasi santri tahfidz putri al-ittifaqiah) dan disana saya diamanahkan oleh para ustad, ustadzah, guru dan kyai untuk mendidik serta mengajarkan santriwati dalam menggunakan bahasa asking menjadi bahasa sehari-hari khususnya bahasa inggris. Ya karena memang itu bagian dan keunggulan saya lebih condong kepada bahasa inggris. \r\n\r\nJika relawan saya belum memiliki pengalaman, tetapi insya Allah akan memiliki. Karena baru saja pada tanggal 17 juni saya mendaftar serta mengikuti tes Ranita (salah satu ukm kampus ) Yang berkaitan dengan aksi relawan baik di alam maupun sosial, baik disaat ada musibah bencana maupun tidak. ',	1,	1655652969,	NULL,	0),
('SCHLR-PTRML-aefb56',	'USR-PTRML-3d3ad',	'Putri Amelia',	'2003-08-04',	'88706383010',	'jalan mulyasari no 40 pasteur bandung',	'Hukum tata negara ',	'UIN SGD BANDUNG',	'3.75',	'2',	'saya adalah seorang wanita yang memiliki cita-cita dan minat bakat dalam bidang pendidikan meskipun saya tahu bahwa saya terlahir dari keluarga yabg biasa saja tetapi itu bukan menjadi halangan saya untuk bisa mendapatkan pendidikan yang jauh lebih baik demi mewujudkan cita-cita saya. saya yakin dengan memiliki usaha yang kuat kita akan menjadi orang yang dapat survive dalam kehidupan dan belajar dengan sungguh-sungguh ialah kunci dari keberhasilan',	'mimpi ialah dapat berkontribusi dalam memajukan indonesia terutama didalam bidang pendidikan. cara saya untuk bisa mewujudkannya ialah dengan terjun langsung kepada masyarakat dengan mengadakan sosialisasi yang bertema pendidikan itu ialah investasi jangka panjang yang harus di upayakan bagi setiap orang',	'saya sedari smp sudah memiliki minat yabg tinggi terutama dalam bidang organisasi. saya terjun langsung dalam membantu otang-orang yang terkrna musibah (pmii) mengobati orang yg sedang kesusahan dan melakukan pertolongan pertama itu ialah hal yang di lakukan oleh seorang relawan . menjadi pengajar pendidik ialah hal yang saya lakukan sambil kuliah untuk menambah pengalaman ',	1,	1654310433,	NULL,	0),
('SCHLR-PTRNL-1b53f0',	'USR-PTRNL-9302d',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655124895,	NULL,	0),
('SCHLR-PTRNL-a3f98e',	'USR-PTRNL-9302d',	'Petronella Charlota Suitela',	'2003-06-25',	'85714833393',	'JL. Kasuari XI Blok F No. 28 Cikarang Baru, RT/RW: 003/007, Kecamatan Cikarang Utara, Desa Mekarmukti, Kabupaten Bekasi',	'Ilmu Hukum',	'Universitas Maritim Raja Ali H',	'3.68',	'2',	'Saya adalah mahasiswa semester 2 Universitas Maritim Raja Ali Haji jurusan Ilmu Hukum. Saya adalah seseorang yang memiliki tekad yang kuat untuk belajar hal-hal baru, saya juga seseorang yang berpikir kritis, kreatif, inovatif dan responsif. Saya dapat bekerja secara individu maupun kelompok dengan baik. Saya tentunya memiliki kemampuan untuk berkomunikasi dengan baik',	'mimpi terbesar saya adalah lulus dengan ipk yang besar dan mendapatkan gelar cumlaude dimana tujuan saya mendapat ipk besar dan cumlaude agar orangtua saya bangga dan mimpi terbesar saya selanjutnya adalah menjadi jaksa sesuai jurusan yang saya ambil pada saat kuliah. Cara saya mewujudkan mimpi saya tentunya langkah awal yang saya dapat lakukan adalah saya harus mengetahui apa yang menjadi keinginan saya dan dimana bidang yang saya kuasai, selanjutnya saya harus menentukan tujuan dari impian saya itu untuk apa,contoh yang dapat diambil adalah impian saya yang menjadi jaksa, tujuan saya menjadi jaksa adalah membuat hukum di indonesia menjadi lebih baik dan semua orang dari kalangan apapun berhak mendapatkan keadilan yang sama rata tanpa membeda-bedakan apapun. cara mewujudkan mimpi saya selanjutnya adalah menentukan goal, dimana saya selalu menulis goal yang sudah saya dapat capai di note, selanjutnya dengan mimpi saya yang menjadi jaksa dan berkeinginan untuk mendapatkan gelar cumlaude tentunya saya harus belajar dengan giat lagi agar mimpi saya dapat terwujud. dan yang terakhir tentunya saya meminta restu dari orangtua agar mimpi tersebut dapat berjalan sesuai dengan yang saya inginkan',	'saya pernah mengikuti volunteer divisi social media di platform instagram yaitu sharing thing dan teen rangers. dimana saya bertugas untuk membuat konten, bertanggungjawab atas branding dalam social media, dan berinteraksi dengan audiens melalui konten-konten yang diupload di media sosial',	1,	1655128059,	NULL,	0),
('SCHLR-PTRNR-84a869',	'USR-PTRNR-b88a8',	'Putri Nur Balqis ',	'1999-06-17',	'82236432502',	'Jalan Medan-Banda Aceh, Dusun Makmur, Desa Pucok Alue Dua, Kecamatan Simpang Ulim, Kabupaten Aceh Timur, Polsek Simpang Ulim, Provinsi Aceh.',	'Ilmu Pendidikan Bahasa Arab ',	'UIN Ar-Raniry Banda Aceh ',	'3.57',	'5',	'Ceria, suka alam, suka fotografi, suka berenang, suka memanah, suka memasak dan suka bergaul dengan orang lain juga tidak suka menyakiti perasaan teman apalagi perasaan kedua Orang Tua. Selalu Berdoa dan terus berikhtiar untuk selalu membahagiakan kedua Orang Tua InsyaAllah Aaamiiin Yaa Allaaah ????.',	'Ingin berangkat Haji dan Umroh bersama Kedua Orang Tua dan keluarga, juga ingin membuat rumah impian untuk kedua Orang Tua. InsyaAllah terus berdoa dengan sungguh-sungguh dan ikhtiar usaha dengan sungguh-sungguh InsyaAllah Allah pasti mewujudkan mimpi terbesarku Aaamiiin Yaa Allaaah ????.',	'Alhamdulillah saya pernah menjadi Duta Lingkungan Aceh Timur tahun 2016, saya banyak belajar tentang lingkungan dan menjaga lingkungan dengan baik dan tidak mencemarkannya, contohnya seperti tidak membuang sampah sembarangan dan mengingatkan masyarakat sekitar untuk terus menjaga lingkungannya.',	1,	1655711346,	NULL,	0),
('SCHLR-PTRSR-1d0b39',	'USR-PTRSR-0e729',	'Putri Suriani Sasradiningsih ',	'2003-06-14',	'81994365923',	'Jl.erba, RT1, RW6, kel.lembah damai, kec.Rumbai Pesisir, kota Pekanbaru, Riau.',	'S1 Manajemen',	'Universitas Riau',	'3.73',	'2',	'Saya Putri Suriani Sasradiningsih, saat ini saya berkuliah di universitas Riau dengan jurusan S1 manajemen yang sedang menjalani semester ke 2. Selain kuliah saya juga melekukan kegiatan lain yaitu kerja part time di suatu store yaitu donat Kalis yang berada di cabang Pekanbaru di sana saya bekerja sebagai kasir kurang lebih sudah 3 bulan. Serta di kampus saya juga aktif di sebuah organisasi yaitu himpunan mahasiswa jurusan manajemen.',	'Mimpi terbesar saya pastinya ingin membahagiakan orang tua saya yaitu ibu saya karna beliau sudah berjuang untuk menyekolahkan saya sampai saat ini, dan saya tidak ingin mengecewakan beliau. Maka dari itu saya bertekad untuk bekerja keras untuk menyelesaikan pendidikan saya dgn baik dan suatu hari nanti bisa menjadi wanita karir yang sukses.',	'Saya dari SD sampai saat ini kuliah selalu mengikuti setidaknya satu organisasi, saat SD saya aktif di organisasi oramungka, SMP saya aktif di organisasi pencak silat dan oramungka, SMK saya aktif di palang merah remaja/ PMR Dan saat kuliah ini saya aktif di organisasi Himpunan Mahasiswa Jurusan/ HMJ Manajemen di bagian bidang PPA (pengembangan potensi akademik)',	1,	1653673658,	NULL,	0),
('SCHLR-PTRYK-b211f1',	'USR-PTRYK-9cdfc',	'putery Ekireginata',	'2002-04-08',	'89666829075',	'Ds Kembang Ringgit DSN Ringgit Rt 03 Rw 07 Kec Pungging Kab Mojokerto Jawa Timur ',	'Pendidikan Bahasa Mandarin Fak',	'Universitas Negeri Malang ',	'3.60',	'2',	'Saya Merupakan Seorang Perempuan berumur 20 Tahun yang saat ini tengah menjalani kuliah di Universitas Negeri Malang dengan mengambil Pendidikan Bahasa Mandarin. Saya Juga aktif berkegiatan di bidang non akademik juga seperti mengikuti internship dan Volunteer yang diadakan secara online. Dengan Durasi dari 10 hari sampai 3 bulan. Dan juga saya juga aktif mengikuti lomba yang berselaras dengan prodi seperti lomba Dubbing film mandarin tingkat nasional dan universitas. serta alhamdulilah saya pernah mendapat juara harapan pertama dari lomba Tik Tok \" Asiknya Berbahasa Mandarin \" tingkat Nasional pada tahun 2021 yang diadakan oleh Pusat Bahasa Mandarin Universitas Negeri Malang . ',	'Untuk Mimpi Terbesar Saya selama beberapa tahun ini adalah Bisa Berkuliah di PTN dengan Jurusan Impian . Dan Alhamdulilah atas izin Allah SWT Saya Berhasil mewujudkannya yang mana diiringi usaha , Tawakal dan Doa . Sekilas Cerita Saya Awalnya Saya adalah siswa SMK yang sebenarnya tidak tahu apa itu SNMPTN , SBMPTN , Dan ujian masuk perguruan tinggi lainnya. Hingga suatu ketika saya  tergerak ingin melanjutkan pendidikan  dengan jurusan yang saya  minati yaitu di bahasa. hingga  saya cari universitas mana yang ada jurusan bahasa yaitu bahasa mandarin.  akhirnya saya menemukan dan itu kebanyakan di PTN  hingga saya membulatkan tekad untuk mengejarnya lewat tes sbmptn karna saya waktu itu Gap year . Saya Belajar Materi di buku , ebook , youtube , hingga mengikuti TO pada uumnya tidak lupa saya meminta ke allah untuk dipermudah dan dilancarkan . Saya juga berusaha untuk menarik hati dari Allah swt dengan mengikuti sholat sunnah , sholat wajib hingga dzikir yang tidak lupa. dan lainnya  dalam sehari. Hingga suatu ketika  Pengumuman pun tiba alhamdulilah Usaha , tawakal serta doa dari saya , orang tua , keluarga , dan teman teman diijabah  oleh nya. \r\n\r\nTidak Sampai disitu saja Pasti adalah mimpi mimpi lain seperti Bisa mendapatkan beasiswa untuk membantu biaya perkuliahan salah satunya yang mana mimpi tersebut juga diimbangi dengan usaha, dan doa ,serta tawakal . Salah Satunya Saya mendaftar beasiswa Ini.????',	'1. Saya Pernah Mengikuti Organisasi selama 3 bulan Secara Online di Komunitas Literasi Psikologi Indonesia Sebagai Head Of Public Relation dimana dalam diviis tersebut saya belajar untuk memimpin dan memanage anggota atau staff yang berjumlah 10-20 Staff , Melakukan Kontrak Kerja Sama dengan pihak lain dalam suatu kegiatan progam kerja . dsb \r\n2. Saya juga penah menjadi Campaign Volunteer diharisenin.com dengan tema #jadiyangkamumau di sana saya belajar banyak tentang ilmu pengembangan skill seperti personal branding , dan copy writing.\r\n3. Lalu Saya Pernah menjadi Social Media Ambasador di Punyalink. disana saya juga belajar banyak hal tentang pengembangan karir yang sehat dan sesuai dengan pribadi itu bagaimana. \r\n\r\n',	1,	1655733163,	NULL,	0),
('SCHLR-PTRYL-1fa0a9',	'USR-PTRYL-2b907',	'PUTRI YUL SETIOWATI',	'2004-07-03',	'89504773609',	'Desa Jojo RT 1 RW 4 Mejobo Kudus',	'Manajemen',	'Universitas Muria Kudus',	'2.78',	'1',	'Nama saya putri, saya umur 18 tahun dan saat ini saya mahasiswa baru di universitas Muria Kudus, universitas swasta yang ada di Jawa tengah, Saya senang belajar di sana terutama karena saya bisa mengambil Studi manajemen, dan juga saya menghabiskan banyak waktu di luar studi saya mengikuti kemajuan teknologi. Untuk efek ini, saya sering mengikuti olimpiade matematika ,wawasan kebangsaan tingkat Nasional mendapatkan piagam,mendali dan dapat memperluas wawasan Saya ingin selalu tumbuh ingin menjadi versi lebih baik lagi pada diri saya saat ini. Saya menyadari bahwa melanjutkan sarjana adalah suatu keharusan dan untuk mewujudkan mimpi saya itu membutuhkan banyak uang. Saya tidak bisa meminta bantuan kedua orangtua saya karena beberapa alasan. Inilah mengapa saya di sini sekarang, melamar beasiswa ini ',	'Mimpi terbesar saya menjadi Wanita mandiri, cerdas, smart, pantang menyerah. Menjadi wanita sejuta impian, Menempuh pendidikan tinggi sangat ini mimpi saya dan kedua ortua menjadi seorang wanita yang tangguh yang bisa memperluas ilmu yang saya dapat . cara mewujudkan di usiaku yang terbilang masih muda menuju dewasa ini, aku memiliki obsesi yang sangat kuat untuk mewujudkan semua impianku. Aku percaya bahwa aku bisa mewujudkannya, karena kunci keberhasilan adalah komitmen, sehingga komitmen itu selalu tertanam dalam hati.',	'Saya belum memiliki pengalaman organisasi karna itu saya ingin memulai awal berorganisasi di forum ybb yang bisa menjadikan saya pemuda yang berguna membantu anak bangsa yang berpotensi untuk menyukseskan dan memajukan bangsa',	1,	1655648134,	NULL,	0),
('SCHLR-PTRYR-444a32',	'USR-PTRYR-a1d51',	'Poetry Aureole Anaqi',	'2006-01-15',	'82240726669',	'Jl. Assofa III No.18, RT.5/RW.1, Sukabumi Utara, Kec. Kb. Jeruk, Kota Jakarta Barat, Daerah Khusus Ibukota Jakarta 11540',	'IPS',	'SMAN 29 Jakarta',	'8.90',	'1',	'Saya Poetry Aureole Anaqi, saat ini saya sedang menempuh pendidikan di SMAN 29 Jakarta, saya mempunyai pribadi yang mengetahui batasan atau sedikit tertutup, tetapi saya mampu berbaur dengan lingkungan sekitar yang berarti saya mampu menyesuaikan sikap dengan lingkungan yang sedang saya hadapi. Sikap pantang menyerah dan berani mencoba hal baru menjadi kelebihan saya. Apabila saya gagal maka saya akan belajar dari kesalahan dan bangkit lagi, terbukti dari beberapa kompetisi, saya tidak mendapatkan juara lalu saya mengevalusi kesalahan saya dan setelah itu saya mengikuti kompetisi lagi. Semakin beranjak dewasa saya semakin sadar bahwa ketakutan dalam diri kita adalah musuh terbesar kita, ketakutan menjadikan kita selalu berada di zona nyaman tanpa ada perubahan dalam hidup. Namun, saya juga memiliki kelamahan karena saya hanya manusia biasa. Kelemahan saya adalah saya sering membuang-buang waktu akibat overthinking terhadap sesuatu yang belum terjadi dan terkadang itu membuat Saya stress, tetapi seiring berjalannya waktu saya bisa mengendalikan pikiran saya, dan saya selalu tanamkan dalam diri saya untuk memberikan yang terbaik dalam setiap waktu dan menyerahkan segalanya kepada Tuhan.',	'Mimpi terbesar saya adalah melanjutkan pendidikan di luar negeri dengan beasiswa lalu membangun sebuah bisnis yang akan ikut serta dalam memajukan perekonomian Indonesia. Upaya yang bisa saya lakukan saat ini \r\nuntuk mewujudkan mimpi saya adalah rajin belajar agar mendapatkan nilai yang bagus karena saya tidak munafik bahwa nilai akan sangat berpengaruh pada saat mendaftar beasiswa. Selanjutnya mengikuti lomba-lomba akademik maupun non-akademik, mengikuti webinar dan volunteer untuk menambah wawasan, memperluas relasi dan mengasah soft skill saya, seperti public speaking. Yang terakhir, saya akan terus meningkat keterampilan berbahasa Inggris yang saya miliki dengan cara menonton film berbahasa Inggris tanpa subtitle, membaca buku berbahasa Inggris, menjawab soal-soal berbahasa Inggris, dan berbicara bahasa Inggris dengan diri sendiri maupun dengan orang lain yang bisa berbahasa Inggris.',	'Di sekolah saya tergabung dalam ekstrakurikuler saman dan saya pernah tergabung dalam brand ambassador salah satu platform di bawah naungan Global Millenial Group. Saya juga sering mengikuti volunteer online. Dari semua kegiatan tersebut saya belajar untuk bekerja dalam team, belajar untuk bisa beradaptasi dan bersosialisasi dengan cepat serta mendapatkan pengalaman baru yang sangat luar biasa. ',	1,	1654581981,	NULL,	0),
('SCHLR-PTRZL-0a43c4',	'USR-PTRZL-9509f',	'Putra Zulpriadi',	'1999-06-19',	'82311308623',	'Jl. Tapaktuan-medan, desa ladang rimba. ',	'Tafsir Al-Qur\'an dan hadits',	'PTIQ jakarta',	'3.80',	'1',	'Alhamdulillah saya dianugerahkan oleh Allah SWT menjadi penghafal Al Qur\'an 30 juz dan menguasai beberapa bahasa asing. ',	'Mimpi terbesar saya adalah memanfaatkan beasiswa ini  untuk menuntut ilmu pengetahuan\r\nDan menyebar luas kan ilmu saya akan saya tuntut nanti agar bermanfaat bagi pribadi saya dan masyarakat sekitar saya nanti.seperti Firman Allah SWT dalam Al Qur\'an surat Ali Imran ayat 110.',	'Saya tidak terlalu memiliki pengalaman dalam berorganisasi, tetapi saya aktif belajar dan mengajar terutama dibidang bahasa asing. ',	1,	1654145326,	NULL,	0),
('SCHLR-PTSYH-683d7c',	'USR-PTSYH-1b143',	'puti syahda kirana',	'2003-06-15',	'85718122015',	'cluster duta asri palem 2 blok AA no. 12A rt 04 rw 04 kec pasarkemis kab tangerang banten 15560',	'bahasa sastra asing/pendidikan',	'universitas negeri semarang',	'3.98',	'2',	'saya seorang mahasiswa semester 2 yang sedang melanjutkan kuliah dengan pilihan merantau dari kota tempat tinggal. dengan minimnya pengetahuan tentang prodi yang saya pilih, tentunya saya lebih memaksimalkan kinerja saya bukan hanya dalam hal mendalami ilmu prodi namun juga dalam ranah organisasi baik dalam kampus maupun pengalaman bekerja diluar kampus. selain menyukai hal berbau tulisan, saya juga menyukai interaksi dengan orang baru, dan cukup menguasai public speaking yang baik, selain itu mempunya jiwa sosial yang tinggi dan tentunya mudah bergaul dengan orang baru.',	'saya memiliki mimpi untuk menunaikan kedua orang tua saya pergi haji ke tanah suci, kemudia menjadi anggota kementrian luar negeri dan hidup sejahtera untuk menyenangkan keluarga. bagaimana cara saya mewujudkannya? mulai aktif untuk mengasah soft skill dan hard skill saya untuk mempersiapkan diri terjun ke dunia kerja. karna bagi saya, ketika saya sudah mampu dan berkenalan dengan dunia pekerjaan semasa kuliah, maka ketika waktu itu datang, saya sudah mampu mengaplikasikannya dalam pekerjaan saya nantinya. dan uang berasal dari pekerjaan, ketika saya sudah mempunyai modal awal untuk bekerja, saya akan mempunyai peluang lebih tinggi untuk diterima kerja, setelah itu saya bisa mendapatkan uang dan mengumpulkan uang tersebut guna mencapai mimpi saya.',	'saya saat ini menjadi anggota komisi bakat dan minat di organisasi himpunan mahasiswa jurusan bahasa dan sastra. didalamnya, saya berperan mengatur dan mengekspresikan konten2 youtube yang berkaitan dengan bakat dan minat, selain itu pula ikut andil dalam setiap kegiatan hima yang berada di lingkungan bahasa dan sastra. ketika SMA, saya pernah menjadi relawan mengajari anak kecil tentang pramuka dan juga mengajari anak SMP tentang ilmu dasar pramuka. saya menyukai hal yang berbau dunia luar.',	1,	1653547347,	NULL,	0),
('SCHLR-QBLML-57ca64',	'USR-QBLML-d934d',	'Iqbal Maulana Yusuf',	'2004-10-12',	'81324719071',	'Ciwastra, Buah Batu, Margasari, Bandung, Jawa Barat, Indonesia',	'MIPA',	'SMA PP Aminul Ummah',	'3.75',	'2',	'Aku berasal dari keluarga yang kurang mampu dalam finansial, tapi aku selalu ingin untuk merubah situasi keuangan keluarga. Maka dari itu, semoga dengan giat belajar dapat merubah situasi yang sedang kualami ini. Dan aku sangat menyukai musik dan game.',	'Mimpi terbesarku adalah menjadi penopang utama keluarga. Dengan cara, belajar dengan giat. Guna untuk mencapai cita-citaku. in other words, agar bisa bekerja dengan cerdas.',	'Iya, saya berorganisasi selama 2 periode. Dengan jabatan sebagai menteri pendidikan. Yang bertugas dalam menjaga mentalitas dan semangat santri dan santriwati di pondokku. intinya aku jadi Nadiem Kariem-nya pondokku. hahaha',	1,	1655538317,	NULL,	0),
('SCHLR-QLRLF-bd65e6',	'USR-QLRLF-fff17',	'AQILA AURELA EFIN SAGITA',	'2006-08-25',	'85755771287',	'Dsn. Kedungbocok Kulon Ds. Kedungbocok RT.07 RW.04 Kec. Tarik Kab. Sidoarjo Prov. Jawa Timur',	'umum',	'SMAN 5 Taruna Brawijaya Jawa T',	'4.00',	'2',	'Saya, Aqila Aurela Efin Sagita, lahir di Ambon pada tanggal 25 Agustus 2006, lahir sebagai anak tunggal. Saya sekarang masih duduk di kelas 10 SMAN 5 Taruna Brawijaya Jawa Timur. Saya adalah orang yang aktif di sekolah saya, saya mengikuti banyak organisasi, saya mengikuti apapun kegiatan yang sekolah saya adakan, saya sering mengikuti kompetisi dan olimpiade baik dari luar maupun di dalam sekolah. Saya adalah orang yang tidak ingin kalah dan dikalahkan, saya selalu berusaha yang terbaik, saya selalu berprinsip untuk mendapatkan apa yang saya inginkan \"jika orang lain bisa, kenapa saya tidak\". ',	'Mimpi terbesar saya adalah menjadi seorang Perwira TNI-AU, Dokter Militer, Hukum Militer. Cara saya mewujudkannya adalah mulai dari sekarang saya berlatih untuk menguatkan jasmani saya dengan rajin berolahraga, saya sering mengikuti kompetisi dan olimpiade sebagai bentuk cara meningkatkan kemampuan akademik saya, dan tidak lupa yang paling penting adalah berdoa dan meminta doa dan restu orang tua saya.',	'iya, saya adalah Komisi E MPK SMAN 5 Taruna Brawijaya Jawa Timur, Wakil Ketua Bidang Minat dan Bakat SKI (Sie Kerohanian Islam) SMAN 5 Taruna Brawijaya Jawa Timur, anggota PASKIBRA SMAN 5 Taruna Brawijaya Jawa Timur, Sekretaris Angkatan 3 SMAN 5 Taruna Brawijaya Jawa Timur, Wakil Ketua kelas X3 SMAN 5 Taruna Brawijaya Jawa Timur.',	1,	1654706742,	NULL,	0),
('SCHLR-QNTSL-1e9e91',	'USR-QNTSL-659e0',	'Qonita Salma',	'2003-09-11',	'85231988174',	'RT 001, RW 003, Dsn Sidomulyo, Ds Sepanjang, Kec Glenmore, Kab Banyuwangi, Jawa Timur Indonesia',	'MIPA',	'SMAN 1 Genteng',	'8.89',	'1',	'Saya, Qonita Salma adalah seseorang yang memiliki ketertarikan dalam bidang sosial dan pendidikan, terutama mengenai perempuan dan anak-anak. Lingkungan beserta problemanya mempunyai pengaruh besar terhadap prinsip, target, atau bahkan terhadap visi dan misi hidup saya. Berbagai masalah sosial yang ada membuat mata saya benar-benar terbelalak dan bertekad untuk berkontribusi dalam upaya mengurangi hal tersebut. Semakin mengarah remaja, latar belakang keluarga dan lingkungan, menjadikan saya memiliki kecenderungan yang serius terhadap dunia psikologi dan filsafat. Keduanya sering menjadi jembatan analisis dalam karya ilmiah yang saya tulis. Sehingga, semakin saya mempelajari psikologi dan filsafat, semakin akrab dan lekat diri ini dengan nilai-nilai sosial serta keterkaitannya dalam bidang lain. Saya adalah sesorang yang memiliki kepribadian plegmatis melankolis. Saya orang yang menyukai kedamaian, dan juga memiliki hasrat sempurna, melihat hal-hal detail, dan analitis. Saya memiliki ketertarikan terhadap bidang yang menekankan hal rumit dan ketelitian seperti kepenulisan ilmiah, namun saya juga condong terhadap bidang seni terutama dalam bidang tarik suara. Tapi dibalik itu semua, saya adalah seseorang yang kurang menyukai tantangan dan mudah tertekan jika hidup tidak berjalan sesuai harapan. Namun seiring belajar tentang self development, saya bisa mengevaluasi dan memperbaiki kekurangan-kekurangan saya. Saya mewujudkannya dengan membiasakan diri untuk menghadapi tantangan, seperti mengikuti organisasi (OSIS, MPK, Takmir), volunteer (Rumah Baca, Women Education, mengelola emosi), ekstrakulikuler dan kompetisi, sehingga saya lebih santai untuk menghadapi tantangan.  Pengalaman itu juga membuat saya lebih realistis dan tidak menuntut segalanya harus sempurna. Karena saya sadar bahwa hidup tidak pernah lepas dari episode kegagalan. Saya memiliki motto “Mimpi untuk hidup dan hidup untuk mimpi”. Mimpi membantu saya untuk memiliki gairah hidup. Ketika saya gagal, saya tidak akan rendah diri, dengan cara mengingat mimpi-mimpi yang sudah saya wujudkan. Lalu ketika saya sudah mewujudkan mimpi, saya tak akan akan mudah puas dan besar kepala, karena masih ada mimpi-mimpi lain yang harus direalisasikan. Sebagai contoh, saya gagal SNMPTN pada bulan maret lalu, sebagai seorang melankolis yang memiliki hasrat sempurna, saya sangat sedih dan merasa gagal. Namun, ketika saya mengingat momen-momen saya mendapat achievement juara 1 KTI tingkat nasional, menjadi pengisi acara HUT RI ke-72 di istana negara, mendapat medali emas olimpiade psikologi tingkat nasional dll, semua itu dapat mengembalikan kepercayaan terhadap diri sendiri sehingga saya dapat bangkit dan mewujudkan mimpi-mimpi di dalam wishlist saya.\r\n\r\n',	'\r\nMimpi terbesar saya adalah dapat memperbaiki kualitas parenting di Indonesia dengan cara mendirikan Lembaga pelatihan dan konseling keluarga untuk membantu para orangtua mengembangkan kualitas pola asuh mereka. Nantinya, lembaga ini juga dibarengi dengan kehadiran platform khusus yang diperuntukkan untuk menebarkan informasi-informasi seputar dunia parenting. Mengapa saya menyoroti kualitas parenting? Sebab parenting memiliki pengaruh terhadap semua aspek perkembangan anak. Baik perkembangan fisik, emosi, sosial, dan kognitif. Hal inilah yang menentukan bagaimana si anak menjalankan kehidupannya dalam masa yang akan datang. Pola asuh dalam sosialisasi primer yang tidak sempurna akan memunculkan hal-hal yang tidak diinginkan, baik oleh keluarga itu sendiri, dan juga oleh Indonesia, karena anak-anak merupakan generasi bangsa yang diharap-harapkan kontribusinya\r\nCara untuk mewujudkan mimpi terbesar saya adalah dengan menghimpun teman-teman yang se-visi untuk mulai bergerak dalam pembuatan platformnya terlebih dahulu. Dua tahun lalu, saya telah mengajukan sebuah karya aplikasi yang berisi edukasi tentang kesehatan mental anak, yang harapannya akan dikembangkan lagi untuk wadah penyebaran edukasi parenting. Kini, saya juga berusaha untuk mengumpulkan berbagai informasi-informasi parenting lalu saya mulai menyebarnya ke dalam media sosial pribadi saya. Namun, kehendak saya untuk menjadi agen perubahan bagi bangsa harus saya mulai dari diri saya terlebih dahulu. Sehingga saya harus lebih mengupgrade kualitas diri, menuntaskan studi dan bisa memperluas kapasitas kebermanfaatan diri. Hal itu akan didapat jika saya mendapatkan tunjangan untuk pengupgrade self-quality berupa sokongan ilmu softskills dan juga sokongan finansial. Harapannya, saya menjadi bagian dari YBB Foundation Scholarship dan dapat mewujudkan impian terbesar saya.\r\n',	'Saya memiliki pengalaman berorganisasi dengan bergabung OSIS dan menjabat sebagai ketua, MPK sebagai koordinator ketakwaan & keagamaan, Takmir sebagai bendahara, dan juga bergabung dalam ikatan OSIS se-Kabupaten sebagai pengurus. Selain memiliki pengalaman berorganisasi, saya juga beberapa kali menjadi relawan. Pada saat saya SMP, saya menjadi relawan rumah baca yang memiliki tugas menyosialisasi dan menggiatkan agenda literasi kepada sekolah-sekolah sekitar dan anak-anak desa. Pada saat SMA, semua kegiatan beralih pada kegiatan daring, sehingga kegiatan volunteer pun berjalan dengan bersosialisasi di media sosial. Saat SMA, saya pernah menjadi volunteer ‘mengelola emosi’ yang berfokus pada penguatan kesehatan mental di masa pandemi. Saya juga pernah menjadi relawan ‘Women Education’ yang berfokus pada pengedukasian peran Wanita sebagai penopang kualitas bangsa. Saat menjadi partisipan di organisasi dan relawan, saya merasakan kebermanfaatan hidup saya bertambah. Hal tersebut mengindikasikan bahwa kesejahteraan hidup saya juga bertambah. Dengan bermanfaat untuk orang lain, saya juga mencurahkan kebermanfaatan untuk diri saya sendiri. Ketika berada dalam lingkup organisasi dan relawan, terdapat tiga kata yang mewakili saya yaitu Optimistic, supportif, dan inclusive. Saya optimis bahwa segala sesuatu yang telah direncanakan dengan baik akan membuahkan hasil yang baik pula. Jika tidak, hal itu tidak lain menghasilkan sebuah pelajaran kehidupan yang lebih besar nilainya daripada sebuah kesuksesan. Supportif, menjaadikan saya sebagai orang yang loyal dan helpful. Dalam tes kepribadian oleh Crystal, saya dapat menjadi penstabil dalam sebuah kelompok dan kemungkinan akan menginvestasikan banyak waktu untuk membangun hubungan dengan patner kerja. Hal ini juga diperkuat dengan kata ketiga saya yaitu inklusif. Saya terbuka dan menghargai segala perbedaan yang terdapat dalam patner saya. saya menganggap kemajemukan adalah perwakilan setiap unsur dalam sebuah tim, dengan begitu, hasil yang dicapai dalam tim adalah sebuah titik tengah terbaik yang mewakili kemajemukan dari setiap anggotanya. ',	1,	1654790079,	NULL,	0),
('SCHLR-QRNHN-a6efdd',	'USR-QRNHN-ec25f',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654521153,	NULL,	0),
('SCHLR-QRRTY-791310',	'USR-QRRTY-9e64d',	'Qurrata A\'yunin ',	'2004-07-08',	'85730117926',	'Kedinding lor Gg Blimbing utara no 7 kelurahan Tanah Kali Kedinding Kecamatan Kenjeran Kota Surabaya Jawa Timur (60129)',	'IPS ',	'SMAN 19 SURABAYA ',	'8.3',	'4',	'Be an eagle, not a duck \r\nSeperti falsafah hidup tersebut yang berarti  jadilah seekor elang bukan bebek, filosofi itu mempunyai makna yakni jadilah seperti seekor elang yang memiliki jiwa berani menghadapi badai ujian di atas awan melambung tinggi. Kesendirian elang dalam terbang menjadikan dirinya selalu berusaha menjadi pribadi yang mandiri. Kemampuan elang dalam berburu menjadi  selalu fokus dalam menjalankan tujuan kehidupan. Elang cenderung lebih suka terbang sendiri,  juga menggali potensi positif di balik suatu masalah. Tidak dengan bebek yang selalu bergerombol kemanapun perginya dan selalu mengeluh berbicara selama perjalanan. seperti itulah saya hidup. Senantiasa menjadi seorang mandiri baik dalam kondisi senang ataupun susah. Bukan berarti dalam artian menjadi pribadi anti sosial. Sendiri dalam arti mandiri dan mampu fokus menjalani kehidupan dengan kemampuan diri sendiri serta tidak menyusahkan orang lain. Nama saya Qurrata A\'yunin, putri kedua dari sepasang pria dan wanita. Saya lahir di tanah Jawa tepatnya di Surabaya. Banyak orang Jawa bilang Urip iku Urup yang berarti bernyala dengan menebarkan manfaat bagi orang lain dimanapun berada. Karena sebaik-baiknya manusia adalah yang bisa bermanfaat bagi orang lain.',	'Zaman sekarang sudah memasuki era digital dimana semua bisa dilakukan melalui media sosial dengan cepat dan praktis. Dengan hal tersebut banyak orang tua yang berfikir hp adalah pengaruh buruk bagi anaknya. Namun tidak dengan saya, saya ingin memanfaatkan hal yang terjadi saat ini dengan baik dan positif dengan berprestasi. Maka dari itu saya bermimpi ingin mendapatkan beasiswa, selain itu juga ingin menjadi wanita karir yang menginspirasi. Hal ini karena saya ingin meringankan beban orang tua, teringat keadaan ekonomi keluarga sedang tidak baik dan membuktikan bahwa saya bermain media sosial tidak hanya semata untuk hiburan melainkan keluar dari zona nyaman saya untuk mencari berbagai informasi mengenai beasiswa, mengikuti berbagai ajang prestasi, juga mencari relasi untuk mewujudkannya. Tidak hanya itu saja saya selalu belajar dari permasalahan yang saya hadapi, dari hidup yang saya jalani dan fokus terhadap tujuan.',	'Iya, sejak memasuki bangku SMP saya sudah mulai suka berorganisasi dengan mengikuti organisasi yang ada di sekolah seperti OSIS dan Paskibra, hingga saya mewakilkan sekolah SMP saya menjadi salah satu peserta yang mengikuti latihan kepemimpinan dan manajemen siswa SMP/MTS se-kota Surabaya dan Latihan Kepemimpinan dan Kebangsaan Siswa SMP/MTS se-kota Surabaya. Sampai saat ini saya pun masih suka dengan kerja sama tim, seperti hal nya di SMA saya juga mengikuti organisasi OSIS pada kelas 10 dan juga organisasi paskibra pada kelas 10 hingga saat ini kelas 11. Bagi saya pentingnya berorganisasi karena kita bisa mendapatkan relasi, banyak pengalaman, wawasan yang kita dapat, kita juga bisa menjadi seseorang yang mandiri, dan masih banyak lainnya. Tidak hanya itu saja organisasi juga merupakan sebuah prestasi bagi saya, dengan berorganisasi kita juga bisa mendapatkan prestasi. Seperti hal nya dengan organisasi paskibra, selain menjadi wakil ketua Paskibra, saya dan tim juga mengikuti berbagai ajang lomba paskibra. Terbukti dengan hal tersebut saya dan tim saya mampu menyaingi dari berbagai tim paskibra dan  mendapatkan juara 1 Se-jawa timur, juara 3 se-Jawa timur, juara harapan 2 se-Jawa timur, dan lain-lainnya',	1,	1655625789,	NULL,	0),
('SCHLR-RBTLD-e3969f',	'USR-RBTLD-b4a3e',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655107954,	NULL,	0),
('SCHLR-RBTLS-82f0c9',	'USR-RBTLS-63e68',	'Rabita Al Islamia',	'2003-03-03',	'85657322471',	'Jl. Tamangapa Raya III, KOMP. Tritura Permai Blok B4/01',	'Teknik Elektro',	'Universitas Hasanuddin',	'3.65',	'2',	'Saya adalah pribadi yang mandiri seperti Suka mengerjakan tugas sendiri, suka melakukan hal-hal lain sendirian. Saya juga adalah tipe pemuda yang cekatan dan ulet karena saya sangat tidak suka keterlambatan dan ketidakteraturan. Saya sangat suka hal-hal yang berbau karya ilmiah, seperti KTI, Proposal, Orasi Ilmiah, dll. Saya suka menantang diri saya dengan hal baru seperti belajar mendesain ketika ada kegiatan, belajar fotografi ketika ditunjuk sebagai fotografi dalam himpunan, dan lain sebagainya. Bisa dibilang saya adalah mahasiswa idealis yang maju akademiknya dan maju juga organisasinya. Saya suka berorganisasi sejak sd karena saya suka mencari teman baru dan pengalaman baru. ',	'Mimpi terbesar saya adalah bisa terjun langsung ke lapangan untuk membantu dan berkontribusi untuk masyarakat daerah. Mengapa masyarakat daerah? Karena menurut saya mereka adalah rakyat indonesia yang kurang atau bahkan tidak mendapat perhatian dari pemerintah dalam hal apapun. Saya ingin terjun langsung sebagai orang yang mampu memberikan perubahan untuk masyarakat daerah terkhususnya di daerah saya.',	'Saya adalah seorang anggota pramuka sejak sd hingga sma. Saya menggeluti organisasi ini dengan kemampuan dan kemauan saya pribadi. Menjadi seorang anggota pramuka, kita ditempa untuk kuat dan tangguh dalam menghadapi tantangan dan rintangan. Di pramuka juga kami selalu mengadakan kegiatan kemasyarakatan seperti pembagian sembako dibulan-bulan penting seperti natal dan ramadhan, kegiatan bakti sosial bersama anak-anak panti asuhan, kegiatan berbagi takjil juga di bulan ramadhan. Kami tidak menganggap semua itu adalah program kerja yang semata-mata harus dikerjakan demi kepentingan organisasi tapi itu semua adalah bentuk kepedulian kita kepada sesama.',	1,	1653562950,	NULL,	0),
('SCHLR-RDNKR-a19775',	'USR-RDNKR-86eef',	'raden kurnia rahmad',	'2001-06-12',	'85753215423',	'Balai karangan, kecamatan Sekayam, kabupaten Sanggau, Kalimantan Barat',	'Pendidikan Guru Madrasah Ibtid',	'IAIN Pontianak ',	'4.00',	'2',	'Saya anak ke 4 dari 4 bersaudara berasal dari keluarga sederhana namun memiliki mimpi yang besar untuk merubah tarap hidup dan bisa bermanfaat untuk seluruh manusia',	'Sukses dihari kedua orang tua dan saudara-saudara saya, dan juga sukses untuk bisa ikut serta dalam memajukan pendidikan di Indonesia',	'Saya masuk kedalam organisasi Persatuan Mahasiswa Melayu (PMM) Kalimantan Barat, didalam organisasi saya dibagian bidang kewirausahaan, untuk organisasi tersebut telah banyak memberikan saya perubahan dalam hidup yang mana tidak didapatkan ditempat lain',	1,	1653748191,	NULL,	0),
('SCHLR-RDNLD-46102e',	'USR-RDNLD-09119',	'Rio Daniel Dalimunte',	'2003-03-15',	'82273762952',	'Jln. Banjarsari, Gg Iwenisari Timur 1, No 35/18, Tembalang, Semarang, Jawa Tengah',	'Manajemen Fakultas Ekonomi dan',	'Universitas Diponegoro',	'3.41',	'4',	'Saya adalah individu yang memiliki tekad dan keberanian yang besar dalam memulai, melakukan bahkan mengerjakan sesuatu. Pribadi yang cenderung kreatif, inovatif, aktif dan solutif dalam berbagai wadah dan dunia perkuliahan yang telah diikuti. Bagi saya melakukan sesuatu hal berorientasi pada proses, hasil adalah bonusnya atau nomor 2. Bukan tentang seberapa besar hasil yang kau dapatkan, namun tentang seberapa besar pengaruh dari proses yang mengubahmu. Saya juga pribadi yang Highly Self-Motivated sehingga mampu mengatasi kejenuhan dan juga rasa malas dalam diri. Kemampuan softskill melalui public speaking, critical thinking, networking dan juga relationship sudah baik dan memadahi dengan berbagai wadah untuk mewujudkannya melalui organisasi, internship, lomba dan juga menjadi MC. Diluar semua itu saya selalu teguh pendirian terhadap prinsip \"i have to be more than before\" Selalu bersyukur dan yakin pada diri sendiri. Selain aktif dalam perkuliahan, organisasi, intern dan juga lomba, orientasi kepada pelayanan Tuhan juga tidak dilupakan dengan bergabung menjadi pelayan pemusik dan pelatihan teater kerohanian di kampus. ',	'Mimpi terbesar saya adalah merintis, mendirikan dan memiliki perusahaan sendiri. Dimana saya menjadi Direktur utamanya yang nantinya perusahaan saya akan bermanfaat bagi orang lain dan juga bisa menjadi peluang baru yang besar potensinya di masa yang akan datang. \r\n\r\nCara untuk mewujudkannya, saat ini saya sedang membangun startup yang bernama CometoCrack.Id yang bergerak di bidang konsultasi lomba buat mahasiswa. Startup ini akan dirintis dan ditata sedemikian rupa melalui produk dan program yang ditawarkan agar bisa mencapai impian terbesar saya. Selain mencapai impian, startup ini juga menjadi wadah saya untuk belajar mengenai sistem kinerja startup dan juga wadah untuk berinovasi dan berkreasi.',	'Ya saya memiliki pengalaman dalam organisasi. Saya telah bergabung dalam 2 organisasi dan sekarang juga tergabung kembali dalam 3 organisasi. \r\n\r\nECOFINSC, organisasi pertama saya selama menjadi mahasiswa. Fokus terhadap literasi dan kelompok studi keuangan. Saya menjadi PIC dari program kerja NGOPI \"Ngobrol Perkara Ilmu\". Saya tergabung dalam divisi akademik yang membidangi bagian edukasi dan kajian seputar keuangan. Selain itu ECOFINSC, mewadahi saya untuk mengasah kemampuan public speaking dengan menjadi MC dan juga Moderator dalam berbagai kegiatan internal ataupun eksternal. Saya sukses mendapat penghargaan sebagai Staff of The Month bulan april dan \"Best Participant\" dalam Mini Disccusion kolaborasi ECOFINSC x HIMIESPA UGM.Saat itu saya dan tim berhasil membuat kajian yang berjudul \"Menelisik pengaruh Goto dalam perekonomian bangsa dan digitalisasi yang berorientasi pada aspek keuangan\"\r\n\r\nIMSU, Organisasi Daerah yang menjadi wadah saya untuk mempererat persaudaraan dan tali silahturahmi diantara mahasiswa asal sumatera utara. Di organisasi ini, saya tergabung ke dalam divisi Kewirausahaan yang berfungsi untuk melakukan pendanaan terhadap organisasi. Saat itu saya dan rekan setim berhasil mendapatkan pendanaan Rp 500 ribu melalui fundraising jaket himpunan orda. \r\n\r\nIMA Sc UNDIP. Organisasi tentang marketing yang saat ini saya ikuti. Dalam organisasi ini saya ambil peran sebagai staff dari bidang RnD (Research and Development). Penelitian dan pengembangan yang ditargetkan melalui konten, lomba dan juga wadah pelatihan marketing bagi internal. Saat ini saya menjadi PIC dalam proker ICT \"IMA Contingent Team\" dan aktif membuat konten harian di instagram. Diawal kepengurusan saya berhasil meraih pengahargaan sebagai Staff Of the Month bulan maret. Saya masih aktif menjadi bagian dari organisasi ini. \r\n\r\nPMK FEB UNDIP. Organisasi kerohanian yang terdiri dari 3 sub utama yakni Harian, Refomedia dan Obkial. Saya menjadi bagian dari Obkial yang menangani teater kerohanian. Saya tergabung dalam divisi Penjala Manusia yang mana bertugas untuk membuat naskah teater, revisi naskah dan pelatihan dasar bagi teater. Di organisasi ini saya berhasil menjadi \"Sutradara Muda Terbaik\" dalam sejarah kepengurusan Obkial. Saya masih aktif menjadi bagian dalam organisasi ini. \r\n\r\nNHKBP KERTANEGARA. Organisasi kepemudaan gereja yang saya ikuti juga hingga saat ini. Dalam kepengurusan ini saya tergabung dalam bidang HUMPER \"Humas dan Pemerhati\" dalam bidang ini saya dan rekan tim aktif dalam kegiatan PA, Ibadah pelayanan Musik, Visitasi kating yang sidang dan wisuda dan juga Visitasi Jemaat yang sakit. ',	1,	1655181537,	NULL,	0),
('SCHLR-RDNMR-910819',	'USR-RDNMR-8dcbf',	'Ridona Marta Derica',	'2004-02-16',	'88286295307',	'jl. kol. h. burlian lr. peristiwa no.259 rt.05 rw.02 kecamatan alang-alang lebar kelurahan srijaya Sumatera Selatan, Palembang',	'Ilmu Hubungan Internasional',	'Universita Sriwijaya',	'3.85',	'2',	'Nama saya Ridona Marta Derica. Biasa dipanggil Donna. Saya dilahirkan kota Palembang pada tanggal 16 Februari 2004. Sejak kecil saya tinggal di kota kelahiran bersama dengan tiga orang kakak laki-laki saya. Saya sangat bersyukur dilahirkan di tengah-tengah keluarga yang sangat menyayangi diri saya. Sejak kecil saya dan tiga kakak saya selalu ditinggal kedua orang tua kami bekerja sebagai pedagang sayuran di pasar tradisional malam hingga siang dan sore nya mereka beristirahat. Sehingga jarang bagi kami untuk berkomunikasi dengan mereka. Saya dan kakak saya memahami jika kedua orang tua kami bekerja siang malam agar anaknya bisa sekolah dengan baik hingga kejenjang perguruan tinggi. Dan kami pun sebagai anak menjalani kewajiban kami yaitu belajar dengan giat. \r\nSD, SMP dan SMA saya tempuh di kota kelahiran saya dengan mendapatkan hasil yang baik dan memuaskan bagi orang tua. Dan tibalah saat saya kuliah, dimana biaya kuliah mulai meningkat tidak seperti biaya sekolah. Itu menimbulkan kekhawatiran bagi saya yang mana kondisi orang tua semakin bertambah tua. \r\nSejak SMA, saya memilih untuk masuk ke jurusan Hubungan Internasional pada saat kuliah. Ada banyak sekali rintangan, cobaan serta tangisan dalam mewujudkannya sehingga akhirnya saya bisa masuk ke jurusan ini. Alasan saya memilih jurusan Hubungan Internasional adalah karena saya tertarik dengan isu-isu Internasional. Saya suka menganalisa dan berpikir kritis tentang Hubungan Internasional. Saya suka mengidentifikasi apa kepentingan suatu pihak dalam melakukan sesuatu di dunia Internasional. Selain itu, saya juga mempunyai cita - cita menjadi seorang diplomat atau duta besar luar negeri yang baik dan berinteraksi dengan masyarakat Internasional. Saya juga suka mempelajari bahasa asing terutama bahasa Inggris. Selain bahasa Inggris, saat ini saya juga sedang memperdalam bahasa Jepang. Dengan berada di jurusan Hubungan Internasional ini, saya berusaha untuk mewujudkan cita-cita saya dan membanggakan kedua orang tua saya.',	'Hidup haruslah punya tujuan. Mengapa? Karena tujuan itu yang akan menjadi pengarah kita dalam menjalani kehidupan. Saya pribadi memiliki beberapa tujuan. Tujuan hidup saya secara umum sederhana, yaitu bermanfaat bagi orang lain, baik keluarga, lingkungan, dan negara. Terdengar sangat biasa, tapi bagi saya itu dapat membuat saya selalu ingin terus berkembang dan menjadi pribadi yang lebih baik. Untuk jangka pendek ini, tujuan hidup saya adalah belajar dengan baik, mempelajari banyak hal positif, memperoleh banyak prestasi, serta memperbanyak relasi. Saya juga tidak hanya belajar hal - hal akademik saja, namun juga belajar bidang non - akademik yang mengasah kemampuan soft skill saya, seperti berorganisasi dan bekerjasama dengan mahasiswa lainnya. Selain itu, saya juga ingin mengikuti kegiatan volunteer, delegasi, pertukaran pelajar maupun kegiatan lainnya agar dapat terus berkembang. Lalu, saya juga ingin lulus kuliah tepat waktu di kampus tercinta saya, yaitu Universitas Sriwijaya. Tentunya tujuan jangka pendek ini akan mendukung tujuan menengah hidup saya. Untuk jangka menengah, saya ingin mengejar beasiswa untuk melanjutkan studi kejenjang yang lebih tinggi yaitu S2 ke luar negeri. Lalu, menggapai cita - cita saya untuk menjadi diplomat atau duta besar luar negeri yang bermanfaat dan berguna bagi negara. Sebagai duta besar luar negeri, saya sangat ingin menjadi duta besar yang \"baik\". Mengapa demikian? Karena, di media massa baik media massa elektronik maupun cetak sering di beritakan betapa buruknya kinerja KBRI (Kedutaan Besar Republik Indonesia) di luar negeri. Contohnya, banyak kasus TKI/TKW yang di hukum mati di negara tempat mereka bekerja, padahal secara hukum mereka tidak bersalah karena mereka ada yang di siksa, di perkosa, dan sebagainya. Dan juga ada yang menjadi korban penipuan yang berkedok pengiriman jasa TKI/TKW. Tapi ternyata mereka malah di jadikan sebagai wanita penghibur. Saya sangat miris dan prihatin dengan nasib mereka. Bisa di bayangkan betapa tersiksanya hidup mereka di negara asing. Menurut saya, kinerja KBRI belum sepenuhnya maksimal dalam melayani warga negara kita di luar negeri. Itulah alasannya mengapa saya memilih jurusan HI dan bercita - cita menjadi seorang duta besar luar negeri. Saya ingin merubah dan memperbaiki sistem yang ada di dalam KBRI agar kita bisa meningkatkan pelayanan, perlindungan kita terhadap warga negara kita yang ada di negara asing. Sedangkan tujuan jangka panjang saya yaitu bahagia dunia dan akhirat serta membahagiakan kedua orang tua saya dan membuat mereka bangga. Tentunya tujuan tersebut yaitu untuk mendapatkan ridho Allah SWT dan masuk surga. Karena kita sebagai manusia nantinya akan kembali kepada - Nya. Lalu, saya percaya dengan selalu berusaha agar berbuat baik ke sesama makhluk dan tidak lupa rajin beribadah, akan mendatangkan hal yang baik juga untuk diri saya. Menetapkan tujuan hidup itu sangat penting, karena setiap langkah - langkah yang kita pilih akan mengantarkan kita lebih dekat pada tujuan akhir hidup kita, agar hidup lebih bermakna dan terarah. Kita tetap manusia yaitu makhluk yang hanya bisa berencana, karena akhirnya semuanya sudah ada yang memutuskan. Jadi, dalam mencapai tujuan tersebut, tiap hari saya harus berusaha dan berdoa untuk menjadi lebih baik dan terus berkembang, sehingga apa yang diinginkan bisa tercapai. Aamiin.. Apapun hasilnya nanti, semoga yang terbaik.',	'Saat ini saya sedang kuliah semester 2 di perguruan tinggi negeri UNSRI jurusan HI dan mengikuti organisasi International Relations Student Association (IRSSA). Saat berada di bangku SMA, selama 2 tahun mengikuti Organisasi English Club, saya sering menjadi perwakilan organisasi untuk mengikuti lomba di tingkat SMA se-kota Palembang. Kegagalan sudah sering saya rasakan, namun itu tidak mematahkan semangat saya untuk terus berusaha dan berjuang sehingga akhirnya saya memenangkan lomba speech dan writing short story se- kota Palembang pada 2019. Saya adalah orang yang tidak mudah menyerah dalam menggapai sesuatu. \r\nSaya mempunyai banyak pengalaman yang tidak akan pernah saya lupakan dalam hidup saya. Ketika saya dan rekan saya berdiskusi untuk membuat suatu proyek agar proyek nya berjalan sesuai rencana dengan baik, ketika kami sharing dan belajar bersama untuk bersama menjadi lebih baik, ketika kami berusaha mencari tutor sana sini agar kami dapat mengikuti lomba secara maksimal, menurutku pengalaman yang sangat berharga itu adalah ketika lomba (misal speech,debate & story telling), kenapa begitu? karna disini lah kepercayaan diri kita dilatih didepan banyak orang. Menurutku kalah atau menang itu hal biasa dalam lomba. Namun, kepercayaan akan diri sendiri bahwa kita bisa itu luar biasa. \r\nDalam organisasi di kuliah, walau melalui media online, namun kami tetap bisa sharing dan bisa belajar satu sama lain.',	1,	1655564847,	NULL,	0),
('SCHLR-RDTNN-ce2dee',	'USR-RDTNN-7376e',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655738728,	NULL,	0),
('SCHLR-RDTNN-e5aa64',	'USR-RDTNN-7376e',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655738784,	NULL,	0),
('SCHLR-RDTPS-1ee9a3',	'USR-RDTPS-34301',	'Ardita Pusparani',	'2003-02-08',	'85746128230',	'Ds. Duduklor, Rt. 002, Rw. 001, Kec. Glagah, Kab. Lamongan, Jawa Timur, 62292',	'Akuntansi',	'Politeknik LPP Yogyakarta ',	'3.60',	'1',	'Saya Ardita Pusparani, lulusan SMA angkatan 2021 yang memiliki tekad kuat untuk belajar, berlatih serta mengembangkan potensi dalam diri. Saat ini, saya menempuh pendidikan di salah satu perguruan tinggi swasta di Indonesia. Saya suka belajar akan hal baru dan memecahkan masalah serta memiliki kepribadian bertanggung jawab.',	'Sebagai seorang mahasiswa, saat ini mimpi terbesar saya yakni mendapatkan beasiswa, di mana hal tersebut tentunya akan memberikan banyak manfaat dan pengalaman melalui setiap program yang diselenggarakan oleh penyelenggara beasiswa tersebut. Dengan mendapatkan program beasiswa serta bisa turut berkontribusi, tentunya akan memberikan kesempatan bagi saya menjadikannya sebagai wadah untuk mengembangkan potensi diri, menuntut ilmu, dan juga menambah pengalaman sehingga lebih siap dan memudahkan dalam mempersiapkan masa depan yang baik. Adapun cara saya untuk mewujudkan impian terbesar saya tersebut, saya berkomitmen serta bersungguh-sungguh dalam berlatih dan mengembangkan kemampuan serta menjalani pendidikan saat ini.',	'Selama SMA saya aktif di beberapa organisasi sekolah, diantaranya OSIS dan Kepramukaan. Melanjutkannya, saat ini saya juga aktif di salah satu organisasi di perguruan tinggi, yakni Unit Kegiatan Mahasiswa Sosial dan Kesehatan (UKM Soskes). Saya bergabung mulai Desember 2021 dan mengemban jabatan sebagai bendahara. Meskipun baru saja bergabung, tetapi banyak pengalaman dan manfaat yang saya dapatkan, seperti lebih bisa mengatur waktu, mengasah jiwa kepemimpinan, menjadi kuat dalam menghadapi tekanan, serta meningkatkan kemampuan bersosialisasi sehingga memiliki relasi yang cukup luas.  Pada saat pembukaan pendaftaran di UKM ini, saya cukup ragu untuk langsung bergabung di bagian inti badan pengrurus harian. Namun, pada akhirnya dengan tekad yang kuat saya meyakinkan diri saya bahwa orang yang menikmati proses harus berani mengambil sikap tindakannya maupun risiko yang akan dihadapinya.',	1,	1654140999,	NULL,	0),
('SCHLR-RFKLY-8a8a16',	'USR-RFKLY-f2f66',	'Rifka Laiyinatus Sifah',	'2001-08-06',	'81390145165',	'Dsn Bunder Tunjungtirto Singosari Malang',	'Sastra Arab Pendidikan Bahasa ',	'Universitas Negeri Malang',	'3.79',	'5',	'Sebagai seorang mahasiswa pembelajar bahasa, saya juga memiliki kecendurangan tuk selalu mempelajari berbagai banyak hal-hal baru seperti pengetahuan mengenai hubungan internasional, mempelajari softskill dan hardskill seperti public speaking, bahasa asing, jurnalistik. Disisi lain, saya juga selalu berusaha untuk upgrading skill agar bisa bermanfaat untuk branding diri sendiri dan bermanfaat bagi oranglain.',	'Mimpi terbesar saya yakni, ingin bisa bekerja dan menjadi bagian dari instansi Sekretariat Jenderal Asia-Pasifik Kementrian Luar Negeri. Untuk cara pewujudannya yakni, selama ini saya telah berupaya untuk mempersiapkan nilai TOEFL, belajar materi seputar CPNS untuk formasi tersebut. Dengan demikian, serta dengan izin Allah saya akan bisa mewujudkan mimpi saya. Terlebih lagi jika saya bisa menjadi seorang Diplomat, tentunya saya lebih akan mempersiapkan untuk hal tersebut.',	'Untuk pengalaman organisasi internal mahasiswa, pada tahun pertama saya kuliah, saya menjadi bagian dari himpunan mahasiswa jurusan Sastra Arab pada divisi Penalaran. Selain itu saya juga menjadi bagian dari anggota persatuan mahasiswa bahasa Arab se-Indonesia pada divisi penelitian dan pengembangan.',	1,	1654344161,	NULL,	0),
('SCHLR-RFLYK-0c563d',	'USR-RFLYK-41833',	'Rafly Akhmad Fachridzy',	'2002-10-09',	'85815980518',	'Kedanyang RT 1 RW 1 Number 3 Sakura street Kebomas Gresik',	'Geophisyc',	'University of Indonesia',	'3.59',	'1',	'My passion is to be a researcher, because by doing research I can explore myself to find an invention that can be useful for the nation and the country, while also taking part in extracurricular scientific work. Since elementary school, I have won competitions in both academic and non-academic fields, such as the futsal olympiad champion, telling story, and many more. When I was in junior high school, I also won many championships such as futsal and scientific papers and then I continued to high school. I want to continue my research at this college level to the maximum, in order to get maximum achievements and can make my campus proud at the national and international level. At the beginning of participating in scientific work, I experienced many difficulties, such as failed tools, proposals that did not pass, and many other obstacles. But I did not give up and One of my inventions is a battery with soursop seeds. This discovery is certainly more natural than batteries in general and can reduce the waste of soursop and used batteries. With this discovery, I succeeded in winning the national 1st place scientific work held by the Ministry of Defense of the Republic of Indonesia. Besides that, I also have other achievements such as business plans, essays, and many more and of course all of them can get awards. Please note, so my research is replacing the basic material in the form of coal into a more natural material. With that, I will explore Indonesia\'s nature so that it can be even more useful for the nation and state.',	'My desire is to feel comfortable in the world of nature exploration, I also have other reasons why I decided to jump into this world. Because nature is an extraordinary gift that has been created by God for the needs of living beings on earth. If the exploration of nature does not take into account the negative side, over time our nature will be destroyed. In addition, most of the exploration in Indonesia is still being taken over by foreign companies, which can earn a total production income of up to 13 billion US dollars. This is very detrimental to the country, which if we cultivate ourselves can generate multiple benefits. With this, I will maximize exploration in Indonesia in a safe way so as not to damage the ecosystem, and can take back natural assets that have been owned by foreigners. so that Indonesia becomes a rich and prosperous country according to my major, namely geophysics. I also want to invite my friends to care about nature that has been robbed by foreigners. We must be aware because this is an asset of our country.\r\nFor that I have steps to start my vision and mission. My first step is, I will learn and develop my relationships to focus and explore the field of exploration both externally and internally, so that I have high intellectual skills to exceed foreign workers, and I can compete in the future. My second step after I have enough knowledge is, starting my plan to start exploration in a safe way, so as not to damage nature but get maximum results. In my way, I create a team of experts in their respective fields, then determine the right steps to carry out in all processes by always considering the positive and negative sides. For this process, I will engage local investors, not foreign investors in funding the process of this activity. I will also employ local men so that the regional economy will also increase. After that I guarded and secured so that it was not taken by foreigners and irresponsible persons. After that I took care of the environment, so that our environment remains beautiful and not damaged. I believe that with my vision and mission, Indonesia will be able to explore independently and sustainably.',	'In the field of organization, I am now the Founder of the SOHOR (Solutin Of House Rubbish) application, which is an application that converts waste into a research product that is very superior. Its products are batteries from soursop seeds, therapy sofas from used bottles, natural battery water, and many more and of course are superior innovation products. In addition, I also served as Deputy Chair of the Research Division of the Faculty of Mathematics and Natural Sciences UI (Research Organization). I am also active in organizations that match my major and passion such as IAGI research staff at the University of Indonesia (mining organization), AAPG research staff at the University of Indonesia (petroleum organization), KSM research staff at the University of Indonesia (research organizations). I really enjoy running all these organizations. All the organizations that I participate in focus on research because it is my passion and I want to hone it well to become more skilled. In high school, I also participated in organizations such as the intra-school organization (OSIS) and the youth mosque of SMAN 1 Gresik. I can manage my time well and I am responsible for all the organizations I join',	1,	1655504884,	NULL,	0),
('SCHLR-RFNFL-088b10',	'USR-RFNFL-52623',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655718427,	NULL,	0),
('SCHLR-RFNNS-5bd5b7',	'USR-RFNNS-8e774',	'Rafannisa Kuncoroningrum',	'2005-01-25',	'895389728283',	'Griya Kondang Asri blok C1 no 28 Desa Kondang Jaya Kecamatan Karawang Timur Kabupaten Karawang provinsi Jawa barat. Kode pos 41371',	'IPA',	'SMAIT MENTARI ILMU KARAWANG',	'9.0',	'4',	'saya seorang pelajar aktif jurusan IPA di SMAIT Mentari Ilmu Karawang, sekarang saya aktif di Remaja Teman Sebaya dibawah BNNK Kabupaten Karawang dan Forum Pelajar Sadar Hukum Kabupaten Karawang dan Jawa Barat, selain itu saya juga turut aktif untuk menyuarakan pendapat melalui MUN Internasional, ASEAN Youth Forum, AIESEC, UNITE 2030 dan amnesty. Saya juga mengoptimalkan waktu saya untuk mengikuti berbagai macam lomba mulai dari olimpiade, orasi dan puisi. Hobi saya menulis dan saya sudah menerbitkan 7 buku antologi puisi.\r\n\r\nSaya pelajar yang memiliki semangat juang lebih, peduli terhadap sesama, bertanggung jawab, berani untuk menyampaikan sesuatu jika itu benar, senang berpendapat, aktif berorganisasi dan siap untuk menyumbangkan  tenaga, waktu dan pikiran  yang lebih serta pengetahuan yang luas yang sangat diperlukan negara dan masyarakat.',	'mimpi terbesar saya yaitu bisa bermanfaat banyak untuk orang lain, salah satunya dengan menjadi diplomat atau duta besar. Maka selama beberapa tahun kedepan  saya akan membiasakan diri untuk peduli sosial, bersikap kritis dan up todate perihal isu dunia. Jika saya diterima pada progam beasiswa  ini, investasi pendidikannya akan saya manfaat kan untuk memperjuangkan mimpi saya sebagai seorang diplomat, dan mungkin 5 sampai 10 tahun lagi saya akan berbicara untuk keadilan dunia dalam sidang PBB yang tidak hanya dinikmati oleh saya pribadi tetapi juga masyarakat dunia.\r\n\r\nDari keinginan keinginan saya diatas mustahil terwujud, jika tanpa usaha keras saya dari sekarang. Untuk itu, langkah- langkah yang saya harus lakukan untuk mewujudkan itu semua, antara lain:\r\n1. Rajin beribadah dan tak menunda- nunda, selalu berpikir postif, dan berhubungan baik dengan teman maupun guru.\r\n2. Menaikkan nilai- nilai maupun IPK dari sebelumnya menjadi lebih bagus.\r\n3. Di semester 5 menuju semester 6 ini, saya harus lebih serius dan fokus lagi menjalaninya. Seperti menyimak guru dengan baik dan mencatat hal- hal penting, mengerjakan tugas tepat waktu, dan sungguh- sungguh dalam mempersiapkann UTS dan UAS.\r\n4. Harus bisa mempertahankan nilai yang bagus dan sebisa mungkin menghindari penurunan nilai.\r\n5.Terus menerus merasa bodoh, karena saya harus terus belajar.\r\n6. Mencoba bekerja menjadi penulis dengan  Gaji yang didapat dari pekerjaan sampingan, sedikitnya disisihkan untuk mengikuti kursus yang diperlukan.\r\n7. Lulus tepat pada waktunya atau bahkan lebih cepat dengan nilai terbaik di antara yang terbaik.\r\n8. Meminta restu orang tua disetiap kegiatan apapun.',	'iya, saya seorang yang sangat tertarik belajar dalam organisasi atau menjadi relawan seperti :\r\n- Brand Ambassador Internasional Model United Nations\r\n- Brand Ambassador of Youth Online Model United Nations International\r\n- Brand Ambassador of AIESEC UPNV jogjakarta\r\n- The best volunteer Australian Awards International\r\n- Volunteer World Voice International Indonesia\r\n-volunteer pemuda bawa perubahan nasional\r\n- volunteer social imconnect nasional\r\n- Brand Ambassador InspiraTalk nasional\r\n- Panitia Gerakan kemanusiaan donor darah se kab Karawang\r\n- Ketua bidang LH\r\n- ketua OSIS\r\n- Wakil Ketua Pelaksana MPLS\r\n- Ketua HUMAS Pramuka\r\n- sekretaris bidang Litbang\r\n- bendahara fpsh karawang\r\n- Anggota forum OSIS Karawang\r\n- Anggota forum OSIS Jawa barat\r\n- seksi pendataan dan informasi mayaba bnnk Karawang\r\n- duta pelajar Rabbani Karawang\r\n- duta hukum dan HAM Kab Karawang & Jawa barat\r\n- duta konselor favorit kabupaten Karawang\r\n- Relawan di Mentari Ilmu Charity dengan membagikan makanan gratis \r\n- Membagikan masker medis gratis di sepanjang jalan\r\n- Menjadi relawan MIC pada saat banjir di Karawang\r\n- Menjadi relawan GenZ dalam mengajarkan baca tulis dan makanan\r\n- Menjadi relawan dalam penggalangan dana untuk Palestine, Rohingya, dan uygyur\r\n- Menjadi relawan penyuluhan bahaya narkoba bersama BNN kabupaten Karawang\r\n- Membagikan baju atau kerudung yang masi layak pakai kepada korban banjir\r\n- Membagikan nasi bungkus kepada korban bencana\r\n- The best volunteer di Australian Awards International\r\n- Volunteer World Voice International Indonesia\r\n- Volunteer pemuda bawa perubahan nasional\r\n- Volunteer social imconnect nasional\r\n- volunteer amnesty Indonesia',	1,	1655705947,	NULL,	0),
('SCHLR-RFNSC-daa49e',	'USR-RFNSC-dcef1',	'Arfina suciyani',	'2004-04-15',	'81224255696',	'jl.jakautama III M-10 Rt01 Rw05, kel: kujangsari, kec: bandung kidul, kota bandung-jawa barat',	'pendidikan senirupa dan keraji',	'universitas pendidikan indones',	'3.74',	'2',	'saya merupakan pribadi yang cinta akan tantangan dan suka mempelajari hal hal baru.sejak kecil, saya ingin selalu unggul diantara teman teman sebaya. keaktifan saya sejak kecil dimulai ketika membantu orang tua berjualan keliling, hingga akhirnya saya menjadi pribadi yang pemberani dan juga pekerja keras. Meskipun Segi finansial keluarga saya kurang, tapi semua itu tidak membuat tekad dan semangat juang saya luntur. Justru, keadaan itulah yang membuat saya terus termotivasi untuk mengejar kesuksesan hingga kini. Saya selalu berpegang teguh pada prinsip \"kesuksesan dimasa depan, adalah cerminan dari masa muda mu\" dengan demikian,Saya berjanji pada diri sendiri untuk terus mengoptimalkan masa muda terkhususnya tiap kesempatan dan merealisasikan semua impian dan cita cita.',	'Bagaimana pun keadaan dan kondisi saya, Sedari kecil saya hanya ingin terus menjadi pribadi yang dapat bermanfaat bagi orang banyak. Dalam segi apapun dan bagaimanapun bentuknya, memberikan kebaikan adalah suatu kebahagiaan tersendiri bagi saya. Nyatanya, Berbagi tidak harus menunggu sukses, untuk berbagi tidak harus menunggu kaya, karena definisi berbagi yang sesungguhnya itu adalah perihal cinta dan kemurnian hati. Saya bertekad untuk menjadi manusia yang berguna lewat ajar-mengajar,dengan itu ilmu yang saya miliki akan terus mengalir dan juga tersampaikan pada manusia lainnya. ',	'Saya mengawali dan mencoba untuk mengikuti organisasi ketika masa smp, yang mana saya aktif dalam OSIS, selama 2 periode. Di tahun pertama, saya menjabat sebagai Seksi Kerohanian. Saya mulai aktif dalam mengikuti rapat, diskusi dan juga perencanaan kegiatan hingga menjadi panitia. Karena peran saya dalam berkontribusi di organisasi cukup baik, akhirnya saya di tunjuk oleh pihak sekolah dan di calonkan menjadi ketua osis. Ternyata setelah mendengar itu, saya menjadi sangat bersemangat dan juga bangga karena telah dipercaya oleh banyak orang. Akhirnya saya resmi jadi ketua osis dan menjabat selama 1 tahun. saya mencoba membuat peraturan peraturan dan juga mengoprasikannya guna mengarahkan siswa lainnya agar menjadi Murid yang berbudi pekerti luhur. Tak lupa, saya juga turut berperan dalam mensukseskan kampung halaman dengan mengikuti Karang Taruna. saya sangat menyukai diskusi dan juga berpendapat, terutama dalam hal perencanaan ',	1,	1655049304,	NULL,	0),
('SCHLR-RFYND-771f64',	'USR-RFYND-db746',	'Arfyani Deiastuti',	'2002-12-06',	'89521232799',	'Jl. Sultan Badarudin II, Bandar Lampung, Lampung',	'Sains Data/Sains',	'Institut Teknologi Sumatera',	'3.73',	'4',	'Saya adalah mahasiswa jurusan sains program studi sains data di Institut Teknologi Sumatera. Saya adalah orang yang bertanggung jawab dan menjunjung tinggi komitmen. Saya aktif di organisasi, kegiatan kepanitiaan, mengikuti bootcamp, webinar, hingga volunteer. Dengan aktivitas yang cukup banyak membuat saya jadi orang yang disiplin dan terencana. Pencapaian terbesar saya diumur yang hampir 20 tahun ialah menjadi mahasiswa berprestasi di jurusan sains dalam rangka dies natalis jurusan sains ke -7. ',	'Mimpi terbesar saya adalah terwujudnya karir menjadi profesional data scientist. Cara saya mewujudkannya sejalan dengan yang saya lakukan saat ini yaitu menjadi mahasiswa sains data, mengikuti berbagai bootcamp dan webinar terkait untuk melatih dan meningkatkan hard skill. Belajar semaksimal mungkin untuk mendapatkan nilai terbaik dan mengikuti berbagai kompetisi. Hal tersebut dilakukan supaya bisa menjunjung kualitas diri pada saat ingin mendaftar magang serta mencari kerja dan pengalaman di bidang data scientist. ',	'Organisasi yang sedang saya jalani ialah Himpunan Sains Data ITERA (HMSD Adyatama) dimana saya berperan sebagai Bendahara Umum. Memantau, Mengelola, mengatur alokasi dana yang ada supaya dapat terealisasikan dengan baik dan teratur. Membuat 4 program kerja yang saya jalani bersama dengan Bendahara 1 saya. Berada di bagian keuangan sebuah himpunan bukanlah hal yang mudah, saya banyak belajar tentang bagaimana mengatur keuangan dengan baik, mengambil langkah yang tepat dengan banyak perhitungan, mengomunikasikannya kebanyak orang, dan masih banyak hal lainnya. ',	1,	1654668107,	NULL,	0);
INSERT INTO `tb_scholarship` (`scholar_id`, `user_id`, `full_name`, `date_birth`, `whatsapp_number`, `current_address`, `field_study`, `school`, `current_gpa`, `semester`, `about`, `dream_come`, `volunteer`, `status`, `created_at`, `modified_at`, `is_deleted`) VALUES
('SCHLR-RFZRH-a2cfb9',	'USR-RFZRH-9aefb',	'ERA FAZIRAH AHMAD ',	'2006-01-17',	'82195140309',	'Dusun Kajang Keke, Desa/Kel Pantama, Kec. Kajang, Kab. Bulukumba, Prov. Sulawesi Selatan ',	'MIPA',	'SMA NEGERI 5 BULUKUMBA ',	'1.80',	'3',	'Saya seorang pelajar hidup di pegalaman desa yang terpencil tapi itu tidak akan pernah bisa mengurangi semangat belajar saya, dan saya aktif dalam berbagai kegiatan di sekolah dan juga di kampung dan saya mempunyai minta ikut event di bidang akademik saya sekarang kelas 11 SMA yang bentar lagi kelas 12 semoga kedepannya semangat belajar dan terus mengapai mimpi ',	'Mimpi terbesar saya bagaimna saya bisa berguna untuk diri sendiri dan orang lain dan bisa membahagiakan kedua orang tua saya, dan saya sangat mempunyai mimpi besar mudah-mudah keterbatasan ekonomi dalam keluarga saya tidak menghalangi untuk mengapai mimpi saya dan bisa menjadi doktor dan saya sangat berminat untuk jadi S3 dan bisa bermanfaat bagi banyak orang dan semua itu tidak langsung di gapai ada sebuah cara atau proses untuk mewujudkannya itu semua karena ini semua tak instan untuk di dapatkan maka dari itu cara saya untuk mewujudkannya dengan belajar sesuai kemampuan berproses dan selalu percaya akan indah di setiap proses karena Allah tak pernah tidur maka berjuanglah lebih banyak karena tidak ada yang instan di dunia ini daftar beasiswa aja butuh persyaratan dan saya selalu memiliki prinsip hidup yaitu belajar sesuai kemampuan berproses pasti ada hasil di setiap proses yang kita jalani, serahkan kepada ke maha kuasa karena dia tau yang mana takdir kita yang paling indah dan baikk.',	'Saya mengikuti berbagai organisasi di sekolah dan mempunyai banyak pengalaman dimna lewat organisasi ini saya bisa ikut event berbagai lomba bisa tampil di depan banyak orang bisa melatih softskil saya dan juga saya tau bagaimana saat kita mengambil keputusan dan menjadi pribadi yang sejatinya bisa menerima semuanya, dan juga organisasi membuat saya percaya diri baik di kelas maupun di lapangan dan mempelajari saya sikap independen dan sikap intelektual. mungkin banyak pengalaman yang saya tidak bisa sebutkan satu persatu. semoga saya bisa lolos dan hasil yang baik proses adalah hasil indah',	1,	1655532594,	NULL,	0),
('SCHLR-RGTRD-cbb3ca',	'USR-RGTRD-752b2',	'REGITA ARDIA PUTRI',	'2001-12-29',	'88239787517',	'Dukuh RT 01, Gadingharjo, Sanden, Bantul, DIY',	'Pendidikan Fisika ',	'UIN SUNAN KALIJAGA YOGYAKARTA',	'3.53',	'2',	'aku Regita Ardia Putri, biasa dipanggil Tata. Aku adalah anak kedua dari tiga bersudara. Aku juga seorang mahasiswi disalah satu Universitas Islam Negeri Sunan Kalijaga. Usiaku 20th, dan di usiaku yang sekarang ini, banyak dari temanku yang sangat menikmati seklai dunia kampus mereka dengan bersenang-senang, main, bahkan istirahat semau mereka. Berbeda dengan aku yang dimana harus mencari uang untuk bisa melanjutkan pendidikanku, ya itu bisa disebut dengan bekerja. Aku kuliah dan memutuskan sambil bekerja, karena keadaan ekonomi keluargaku yang tidak memungkinkan untuk aku mintai biaya kuliah. Maka dari itu, bagaimanakpun aku harus bekerja keras demi bisa menvapai Sarjana dan untuk mewujudkan kebahagiaan kedua orang tuaku .',	'mimpi tyerbesarku saat ini adalah ingin melihat orang tuaku tersenyum karena segala prestasi dan pencapaianku kelak di hari mendatang. Apapun nanti yang menjadi targetku untuk masa depan akan ku usahakan. Pertama aku ingin menjadi seorang guru/dosen, langkah selanjutnya jika guru maupun dosen tidak menjadi rejekiku, aku ingin menjadi seorang sekretaris disebuah perusahaan. Untuk mewujudkan salah satu mimpiku, aku akan berusaha, belajar, berdoa, serta berserah diri kepada Allah SWT, apapun yang menjadi pekerjaanku kelak.',	'Iya, di SMP aku mengikuti organisasi kepramukaan yaitu Dewan Penggalang atau DP, dari organisasi tersebut aku berhasil mengikuti perwakilan Jambore tingkat Kabupaten dan tingkat Provinsi DIY. Banyak pengalaman serta teman baru yang aku dapatkan disana. Laliu, memasukki jenbjang SMA aku juga mengikuti organisasi kepramukaan yaitu Dewan Ambalan, dari hal itu aku juga sering berkemah di alam yang menjadikanku mempunyai pengalaman yang indah.',	1,	1654675346,	NULL,	0),
('SCHLR-RHMNR-bd96eb',	'USR-RHMNR-36ae1',	'RAHMI NUR ANISAH NASUTION',	'2002-05-12',	'83184647813',	'Jl. Bangau Sakti gg. Putri no. 3 Rumah Aufifa, kec. Tampan. PANAM',	'Kimia/Fakultas Matematika dan ',	'Universitas Riau ',	'3.98',	'4',	'Saya mahasiswa yang berpikiran terbuka, selain itu saya juga sangat optimis dalam melakukan sesuatu, dan saya memiliki ambisi yang harus saya perjuangkan, saya senang jika memiliki banyak relasi.',	'Impian terbesar saya hanyalah untuk membahagiakan orang tua saya dengan cara saya harus meraih kesuksesan saya. Cara saya untuk mewujudkan nya ialah dengan giat belajar dan aktif dalam beberapa kegiatan selain itu saya juga berusaha untuk mendapatkan ilmu tidak hanya dalam lingkup universitas melainkan melalui webinar, mentoring dan lainnya',	'Saya memiliki pengalaman dalam berorganisasi yaitu organisasi Palang merah remaja (PMR) dalam berorganisasi tersebut saya merupakan seorang fasilitator dan juga beberapa kali mengikuti perlombaan',	1,	1654699765,	NULL,	0),
('SCHLR-RHMPT-0e8fa3',	'USR-RHMPT-c9b33',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654873880,	NULL,	0),
('SCHLR-RHMTN-80b50e',	'USR-RHMTN-4941a',	'RAHMAT NOOR ISNANTO',	'2003-04-07',	'8998131474',	'PONDOK ALAM PERMAI BLOK C 1 NO 84 RT/RW 001/007 KEL. ALAM JAYA KEC. JATIUWUNG KOTA TANGERANG BANTEN 15133',	'S1 MANAJEMEN/FAKULTAS EKONOMI ',	'UNIVERSITAS SULTAN AGENG TIRTA',	'3.58',	'2',	'Assalamu\'alaikum Wr. Wb. Izin memperkenalkan diri, nama saya Rahmat Noor Isnanto dan saya sedang berkuliah semester 2 di Universitas Sultan Ageng Tirtayasa. Di semester 2 ini, saya sudah banyak mempelajari mata kuliah tentang manajemen dan saya sangat menikmati berkuliah di jurusan manajemen ini. Saya berharap bisa diterima di beasiswa ini, karena bisa dibilang keadaan ekonomi keluarga saya pas pas an dan yang mencari nafkah di keluarga saya hanya bapak saya untuk menafkahi saya, adik, dan ibu. Terimakasih Bapak/Ibu.',	'Mimpi terbesar saya adalah untuk membahagiakan orang tua saya dan cara saya untuk membahagiakan orang tua saya adalah dengan melanjutkan pendidikan di perguruan tinggi, untuk mendapatkan ilmu yang lebih banyak. Dengan begitu, jika saya sudah lulus dari perguruan tinggi, Insya Allah saya bisa membahagiakan orang tua saya.',	'Sewaktu saya di SMA, saya pernah mengikuti ekstrakurikuler paskibra dan saya sudah banyak mengikuti perlombaan paskibra. Selama saya mengikuti perlombaan paskibra, saya sudah banyak mendapatkan juara baik tingkat kota, provinsi, maupun sepulau jawa.',	1,	1655733320,	NULL,	0),
('SCHLR-RHMTN-b1b52d',	'USR-RHMTN-4941a',	'RAHMAT NOOR ISNANTO',	'2003-04-07',	'8998131474',	'PONDOK ALAM PERMAI BLOK C 1 NO 84 RT/RW 001/007 KEL. ALAM JAYA KEC. JATIUWUNG KOTA TANGERANG BANTEN 15133',	'S1 MANAJEMEN/FAKULTAS EKONOMI ',	'UNIVERSITAS SULTAN AGENG TIRTA',	'3.58',	'2',	'Assalamu\'alaikum Wr. Wb. Izin memperkenalkan diri, nama saya Rahmat Noor Isnanto dan saya sedang berkuliah semester 2 di Universitas Sultan Ageng Tirtayasa. Di semester 2 ini, saya sudah banyak mempelajari mata kuliah tentang manajemen dan saya sangat menikmati berkuliah di jurusan manajemen ini. Saya berharap bisa diterima di beasiswa ini, karena bisa dibilang keadaan ekonomi keluarga saya pas pas an dan yang mencari nafkah di keluarga saya hanya bapak saya untuk menafkahi saya, adik, dan ibu. Terimakasih Bapak/Ibu.',	'Mimpi terbesar saya adalah untuk membahagiakan orang tua saya dan cara saya untuk membahagiakan orang tua saya adalah dengan melanjutkan pendidikan di perguruan tinggi, untuk mendapatkan ilmu yang lebih banyak. Dengan begitu, jika saya sudah lulus dari perguruan tinggi, Insya Allah saya bisa membahagiakan orang tua saya.',	'Sewaktu saya di SMA, saya pernah mengikuti ekstrakurikuler paskibra dan saya sudah banyak mengikuti perlombaan paskibra. Selama saya mengikuti perlombaan paskibra, saya sudah banyak mendapatkan juara baik tingkat kota, provinsi, maupun sepulau jawa.',	1,	1655733408,	NULL,	0),
('SCHLR-RHNPT-5b3504',	'USR-RHNPT-b1b6f',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655736894,	NULL,	0),
('SCHLR-RHNPT-d6977c',	'USR-RHNPT-e59c3',	'Reihan Putra Dewanto',	'2002-09-20',	'87744588479',	'Jalan Pulau Bokori E13/14 Sunter Kodamar, Kelapa Gading',	'Statistika',	'Universitas Diponegoro',	'3.64',	'4',	'Saya adalah mahasiswa Statistik Undip semester 4, berasal dari jakarta tepatnya kelapa gading. Saya sendiri merupakan orang yang gampang belajar hal baru sehingga bisa dengan maksimal mengerjakan hal baru. Saya sendiri juga orang yang mudah beradaptasi dengan lingkungan sekitar saya. Saya sendiri menyukai belajar hal baru dan tak takut untuk gagal',	'Mimpi terbesar saya adalah untuk bisa S2 di luar negeri dan nantinya bisa membantu mencerdaskan bangsa. Untuk mengejar mimpi tersebut tentunya saya sendiri belajar banyak hal, bagaimana belajar bahasa inggris dengan baik melakukan observasi bagaimana kuliah di luar negeri dan tentunya memperdalam ilmu agar nantinya bisa melakukan riset. Untuk mencerdaskan bangsa, saya ingin melakukan berbagai riset yang berhubungan dengan olah data statistika dan harapannya warga bisa memakainya sebagai dasar mengambil keputusan dan ingin warga mengerti bahwa statistika itu penting dalaam kehidupan dan asik',	'Saya sejauh ini sudah mengikuti organisasi berupa Senat Mahasiswa FSM atau Senat tingkat fakultas dan sejauh saya menjalani kegiatan organisasi di SM FSM saya telah belajar banyak. Saya jadi paham bagaimana student goverment bisa berjalan dan bagaimana cara kerja bidang legislatif. Di senat saya belajar bagaimana mengawasi ormawa dan melihat transparansi dana yang dipakai oleh ormawa. Tahun ini saya sendiri didapuk menjadi ketua komisi 4, yaitu komisi yang berdungsi mengawasi himpunan dan sejauh ini saya bisa mengawasi 6 himpunan yang menggunakan dana fakultas dan menjaga komunikasi dengan 6 himpunan tersebut',	1,	1655737973,	NULL,	0),
('SCHLR-RJMRK-063cfd',	'USR-RJMRK-db671',	'Raja M Arkan',	'2005-08-17',	'895421207790',	'Jalan Ciliwung Dalam no 15',	'MIPA',	'SMAN 5 Bandung',	'3.44',	'4',	'Halo, perkenalkan nama saya Raja M Arkan biasa dipanggil Raja, saya berdomisili di Kota Bandung dan saat ini sedang bersekolah di SMAN 5 Bandung kelas 11, hobi saya adalah mendengarkan musik dan mendalami ilmu sains khususnya di bidang matematika dan fisika',	'Saya sangat ingin dapat berkuliah di NTU(Nanyang Technological University) Singapore jurusan Actuarial Science(ACS). Untuk mewujudkannya, saya mulai mencari informasi-informasi tentang berkuliah di sana, beasiswa, tentang jurusan ACS itu sendiri, mengikuti berbagai macam olimpiade, berlatih soal-soal SAT,ACT, lebih mengembangkan diri sendiri, dsb.',	'Ada, saya pernah menyalonkan diri menjadi ketua angkatan, ketua umum DKM, menjadi koordinator divisi sponsorship, dan menjadi panitia acara-acara di angkatan',	1,	1655647362,	NULL,	0),
('SCHLR-RJZHR-07c2ff',	'USR-RJZHR-5fdc3',	'RAJA AZHAR',	'2004-01-12',	'82196579582',	'Jl. Tanjung, Blok A13 No.12A, PUP, Sektor 5, RT 008/024, bahagia, babelan, kab. Bekasi, jawa barat 17610',	'IPS',	'MAN Insan cendekia Gorontalo',	'3.20',	'6',	'Saya adalah anak sulung dari 2 bersaudara. lahir dari keluarga menengah, yang tidak keatas maupun kebawah. Tinggal di daerah kabupaten Bekasi bersama keluarga saya. saya bersekolah di MAN Insan cendekia Gorontalo, disana saya tinggal dalam lingkungan asrama madrasah. Saya mengambil jurusan IPS, dan saya sangat menyukai pelajaran pelajaran sosial seperti sosiologi, sejarah, dan lainnya. Sangat menyukai kegiatan sosial maupun kegiatan seperti diskusi, presentasi dan debat. Tahun ini akan melanjutkan pendidikan di Universitas Pertamina, dengan jurusan Hubungan Internasional',	'Mimpi terbesar saya adalah menjadi seorang diplomat besar yang berkontribusi bagi negara. Saya ingin menjadi seorang diplomat ulung seperti H. Agus salim, dsb, dapat menjadi perwakilan Indonesia di berbagai negara maupun forum forum Internasional seperti PBB. Untuk mencapai cita cita tersebut, saya berusaha untuk terus mengasah kemampuan bahasa dan diplomasi serta memperdalam wawasan soal masalah masalah sosial baik di dalam maupun luar negeri. Setiap hari nya saya akan membaca banyak buku dan artikel soal sejarah, sosial dan lainnya serta berita berita terkini terkait masalah itu. Dan selama 2 kali seminggu saya menjalani les bahasa inggris, untuk memperdalam kemampuan dan memperlancar bahasa saya. Dan tak lupa berdoa kepada allah serta mengaharapkan ridho dari orangtua untuk mencapai cita cita tersebut.',	'Saya mempunyai 2 pengalaman organisasi. Pertama, saat MTS, saya menjadi ketua angkatan dari generasi saya. Saya bertanggung jawab soal acara acara angkatan, memastikan kedisiplinan angkatan dan menjadi penghubung utama antara angkatan dan dewan guru.  Sementara yang kedua adalah saat masa MAN, saya menjadi anggota OSIS bagian keamanan dan kedisiplinan. Dalam Divisi saya, saya bertanggung jawab atas kedisiplinan murid murid semua untuk mematuhi aturan aturan di sekolah, serta mengondisikan situasi yang tertib, dan sekaligus diberi wewenang untuk memberi hukuman bagi yang melanggar peraturan tersebut.',	1,	1655543097,	NULL,	0),
('SCHLR-RKHSS-2efe12',	'USR-RKHSS-5e2fc',	'Rakha Sastra Rosadi',	'2005-11-19',	'8872176911',	'Bukit Cimanggu City, Blok U 11 No 7-8 RT 10 RW 14, Kelurahan Cibadak, Kecamatan Tanah Sareal',	'Keagamaan (Ilmu Tafsir)',	'MAN 2 KOTA BOGOR',	'4.00',	'2',	'Saya Rakha Sastra Rosadi seorang pelajar di MAN 2 KOTA BOGOR, saya adalah orang yang senang mengeksplor hal baru yang menarik bagi saya, saya senang berolahraga dan saya senang belajar terkhusus belajar bahasa (arab & inggris).',	'Saya punya mimpi membawa keluarga saya untuk berkeliling dunia terlebih ke Arab, saya bercita-cita memberangkatkan keluarga saya pergi haji/umrah, cara saya sebagai pelajar untuk mewujudkannya saya berusaha semampu saya untuk berprestasi di sekolah ataupun diluar sekolah serta berperilaku baik kepada kedua orangtua saya.',	'Saya adalah pengurus OSIS MAN 2 KOTA BOGOR (Sekretaris Bidang 1/Keimanan dan Ketaqwaan), saya juga adalah seorang pengurus kajian di SUNTHREE MAN 2 KOTA BOGOR sebagai Ketua PJ divisi Tahfidz, dan saya adalah seorang pengurus masjid (DKM) Ar-Ridho seksi pembinaan remaja dan dakwah.',	1,	1654437782,	NULL,	0),
('SCHLR-RKMHR-c67878',	'USR-RKMHR-fdb3c',	'Arika Mahira',	'2003-11-03',	'85709810524',	'Jalan Cempaka dalam gang kompas palembang',	'Budidaya Perairan',	'Universitas Sriwijaya',	'4.00',	'2',	'Namaku adalah Arika Mahira. Umurku 18 tahun dan sekarang sedang menempuh pendidikan S1 di Universitas Sriwijaya tepatnya di Budidaya Perairan. Hobiku adalah membaca dan mengoleksi buku. Menurutku, aku adalah orang yang cukup konsisten dalam melakukan suatu hal terlebih jika aku sudah memiliki tekad dan keinginan. Aku juga lumayan ambis dalam hal tertentu. Kekuranganku adalah aku masih lumayan susah untuk mengontrol emosi ku/moodian, yang dapat mengakibatkan semuanya kacau.',	'Mimpi terbesarku adalah menjadi pengusaha dalam bidang apapun yang bisa kulakukan dan menjadi ASN. Caraku mewujudkannya adalah dengan bersungguh sungguh dalam belajar, berlatih dan mempraktekannya kedalam kehidupan nyata. ',	'Iya, saat SMA aku mengikuti ekskul Kelompok Ilmiah remaja (KIR) yang Alhamdulillah diamanahkan menjadi sekretaris umum 1 dan juga rohis di SMA N 2 Palembang. Aku juga mengikuti berbagai kegiatan kepanitiannya, bahkan pernah menjadi ketua pelaksana dalam salah satu kegiatannya. \r\nDi bangku perkuliahan ini, aku mengikuti berbagai ormawa juga seperti Himpunan Mahasiswa Akuakultur (HIMAKUA), Lembaga Dakwah Fakultas Badan Wakaf dan Pengkajian Islam (LDF BWPI) DAN Unit Kegiatan Mahasiswa Bahasa (UKM BAHASA). Aku juga mengikut sertakan diriku dalam berbagai kegiatan kepanitiannya. Dan kemarin juga aku diamanahkan menjadi ketua pelaksana untuk kegiatan kajian ramadhan di himakua.',	1,	1655727513,	NULL,	0),
('SCHLR-RKRHM-2ae6ba',	'USR-RKRHM-71983',	'Reka Rahma Yulistina',	'2003-07-24',	'81539310994',	'KOTAAGUNG TIMUR, KABUPATEN TANGGAMUS, PROVINSI LAMPUNG',	'TEKNIK SISTEM ENERGI',	'INSTITUT TEKNOLOGI SUMATERA',	'3.13',	'2',	'nama saya reka rahma yulistina umur 19 tahun, anak pertama dari 3 bersaudara, berkuliah di institut teknologi sumatera, jalu masuk SNMPTN, tinggal di asrama ITERA ',	'mempi terbesar saya yaitu dapat berkontribusi untuk membantu pemerintah dalam mewujudkan indonesia sejahtera, terutama dalam sektor pemanfaatan suatu energi terbarukan. dan cara saya untuk mewujudkannya yaitu dengan belajar tentang energi terbarukan dengan masuk jurusan sistem energi, mengikuti webinar yang mencangkup tentang energi.',	'Organisasi yang pernah saya ikuti yaitu OSIS, ENGLISH CLUB, dan Publik speaking yang dibuka khusus anak asrama institut teknologi sumatera',	1,	1654949318,	NULL,	0),
('SCHLR-RKRHM-bbe647',	'USR-RKRHM-d68d9',	'Erika Rahmawati',	'2001-06-21',	'895422866097',	'Jatimulyo, Alian, Kebumen, Jawa Tengah 54352',	'Ilmu HukumHukum',	'Universitas',	'3.88',	'4',	'Perkenalkan saya Erika Rahmawati, merupakan anak ke-5 dari 7 bersaudara. Saya tinggal di Jatimulyo, Alian, Kebumen, Jawa Tengah. Saat ini, saya merupakan mahasiswa semester 4 Fakultas Hukum Universitas Airlangga.\r\nAda banyak hal yang sulit saya ceritakan-tentang diri saya. Namun, akan saya ceritakan bagaimana saya membuat daftar dalam ingatan terkait mimpi-mimpi yang pernah dan masih menjadi bagian mengapa saya masih bertahan dan optimis dalam menjalani kehidupan saat ini. Berbagai hal kecil dan sederhana yang sebisa mungkin saya ingat. Apapun itu.\r\nDulu sewaktu menginjak usia remaja, sewaktu saya duduk di bangku SMP saya bercita-cita menjadi orang yang bebas. Seseorang yang bisa pergi kemanapun dan kapanpun-layaknya seorang bajak laut yang memiliki kompetensi penuh atas kapal dan mimpi-mimpi yang turut ditampungnya. Dalam hal ini, saya terinspirasi dari anime One Piece bahwa ada banyak hal yang patut dan selayaknya kita perjuangkan, bahkan ketika ombak dengan kencangnya sedang menghantam, kita hanya perlu tetap bertahan dan berjuang, kan?\r\nNamun, lambat laun laju kehidupan agaknya menampar saya dengan keras. Ya, ada banyak hal yang telah terjadi dan tentu akan terjadi di luar kendali saya. Namun yang saya percayai adalah tetap berusaha yang terbaik untuk menghadapi segalanya dengan penuh rasa optimisme.\r\nSewaktu SMA, mau tidak mau saya dihadapkan oleh realitas yang makin menggugah “jiwa, asa, dan rasa”. Sebagai seorang manusia, sudah fitrahnya untuk mempunya tujuan dan cita-cita mulia akan seperti apa pada selanjutnya. Waktu itu saya masih naif-sangat. Saya ingin bekerja di perusahaan ternama, mendapatkan gaji yang cukup, memiliki pertemanan yang sehat, mendapatkan lingkungan yang mendukung- sungguh, kehidupan yang amat teramat sempurna.\r\nAgaknya waktu memang bisa mengubah banyak hal dari sisi manusianya itu sendiri-entah dari segi pemikiran, perspektif, maupun sikap entah menjadi lebih baik ataupun buruk. Hal yang demikian terjadi dengan saya. Kini, menginjak di bangku kuliah saya lebih sering memikirkan bagaimana filosofi hidup yang baik dan benar. Bagaimana kita menjadi manusia, bukan hanya bersikap ke diri sendiri secara baik dan benar, tetapi juga bagaimana kita dituntut untuk bisa memperlakukan orang lain dengan bijak.\r\nSaya bukan lagi ingin menjadi bajak laut, cita-cita yang agak terbilang konyol sebab mengatasnamakan kebebasan. Bagi saya, kini tampaknya hal tersebut mengalami sedikit pergeseran. Bebas yang demikian bukan sebebas-bebasnya. Memang benar, bagaimanapun juga saya adalah kendali atas diri dan mimpi saya secara penuh. Namun, kembali lagi bahwa saya lahir dan merupakan bagian dari peradaban. Ada banyak hal yang harus dipikirkan ketimbang hanya mengatasnamakan-kebebasan atas individu.\r\nKini, cita-cita saya tidak muluk-muluk, tapi juga bukan berarti tidak membutuhkan perjuangan keras untuk menggapainya. Saya ingin menjadi manusia yang tidak hanya memanusiakan diri sendiri, tetapi juga tentunya orang lain. Ada banyak alasan mengapa cinta membuat hidup terasa lebih indah dan damai. Ketika kita dalam hidup, saling memahami akan kekurangan dan kelebihan, perbedaan dan persamaan, banyak orang yang justru dapat menjadikan kita makin kaya akan peradaban. Yang dalam hal ini, diperlukan adanya timbal balik, serta saling mengisi dan memberikan wawasan dengan penuh afeksi.\r\nSaya juga berharap, kelak saya dapat menjadi orang dewasa. Yang mampu bertanggung jawab penuh atas dirinya sendiri, dan bagaimana memperlakukan orang lain dengan arif.\r\nBagaimanapun juga, jika kita percaya pada diri sendiri, kita tidak akan menyesal jika melihat ke belakang. Lagipula kita hanya hidup satu kali, jadi mari bekerja keras bersama.',	'Sewaktu SMA, saya berkesempatan untuk melakukan study tour ke Bali. Waktu itu perjalanan menggunakan kapal. Dan waktu itu saya ingat betul, “Ya Allah saya ingin naik kapal lagi kapan-kapan, tolong acc ya”.\r\nKemarin, sewaktu Ramadhan 2022, kakak pertama saya bercerita panjang lebar tentang indahnya NTT. Dan dengan sikap saya mengatakan “Ya besok aku ke NTT ya, kapan-kapan”.\r\nSaya memang pernah bermimpi untuk mengunjungi Indonesia bagian Timur, tepatnya NTT. Bukan sekadar untuk liburan tentunya. Sebab saya pikir, bertemu dengan orang dan wilayah yang baru akan menambah perspektif dan wawasan kita dalam menjalani hidup yang serba kompleks ini. Saya percaya bahwa dengan mengunjungi tempat baru dan bertemu dengan banyak orang-orang maka akan ada banyak hal yang menjadikan wawasan saya meningkat serta insight yang bertambah. Akan segala culture yang berbeda, mulai dari makanan, pakaian, bahasa, dan lain sebagainya yang menjadikan saya sadar bahwa saya hanyalah makhluk teramat kecil yang telah lahir dan menjadi bagian dari peradaban manusia yang luar biasa dan besar ini. Yang dengan itu, saya akan dapat memahami dengan benar bagaimana cara mencintai segala perbedaan yang ada melalui pendekatan berbagai cita rasa manusia. Sebab bagaimanapun juga, peradaban lahir secara dinamis dan humanis.\r\nTerkait bagaimana mewujudkannya, sewaktu itu malam hari, tepatnya sekitar akhir Mei 2022 saya membaca di media sosial ada pendaftaran volunteer untuk mengabdi di NTT selama 10 hari. Pendaftaran program tersebut terdiri dari 4 tahap, yaitu registrasi, study case, LGD, dan wawancara. Bagaimanapun saya ingat akan mimpi saya yang sudah saya bangun sejak sangat lama-ke NTT. Tanpa pikir panjang saya pun mendaftar program tersebut. Persiapan pengetahuan, wawasan, pikiran, tenaga, dan mental saya pelajari dengan sebaik mungkin. Agaknya usaha memang tidak pernah mengkhianati hasil. Saya berhasil hingga tahap akhir, yaitu wawancara. Kini, saya sedang mengajukan permohonan dana ke kampus agar saya mendapatkan keringanan biaya sehingga nantinya dapat mengikuti kegiatan volunteer tersebut.\r\nSaya ingat betul, mimpi saya saat itu hanyalah bisa menapaki tanah NTT. Namun, Tuhan Maha Baik dengan segala Kebesaran dan Kasih Sayang-Nya. Dan ya saya percaya bahwa akan selalu ada jalan yang teramat baik, khususnya kepada orang yang mau berjuang dan percaya atas mimpi dan dirinya sendiri. Pada Agustus 2022 besok, saya diberikan kepercayaan untuk tidak hanya sekedar mengunjungi NTT, namun juga bagaimana bisa membaur dan diberi kesempatan untuk hidup berdamping dengan masyarakat NTT. Ya-saya harap, hal tersebut dapat menjadikan saya sebagai manusia yang makin bisa bersyukur karena hal tersebut sangat indah dan menentramkan hati-tidak bisa dibayar dengan apapun dan berapapun.\r\nKemudian, cita-cita terbesar saya di waktu dekat ini, tepatnya insya Allah di tahun ini adalah saya menargetkan untuk mengikuti forum yang ditujukkan kepada generasi muda menanggapi era society 5.0 di negara Turki. Ah, siapa yang tidak kenal akan keindahan negeri tersebut, pikir saya. Spesifiknya, dalam forum tersebut saya tertarik membahas mengenai bidang pendidikan. Seperti yang kita tahu merujuk pada agenda Tujuan Pembangunan Berkelanjutan (Sustainable Development Goals) yang telah resmi disahkan oleh PBB, disebutkan pada point ke-4 mengenai terpastikannya pendidikan yang inklusif dan berkualitas setara, serta mendukung kesempatan belajar seumur hidup bagi semua dan melihat sistem pendidikan Indonesia saat ini maka saya pikir akan perlu sekali mendiskusikan hal tersebut dengan pihak-pihak lainnya. Dengan bertemu orang baru, wilayah baru, maka akan semakin diri ini merasa bahwa ada banyak hal dan wawasan yang harus di eksplor. Kita sebagai manusia harus break our boundaries untuk menjadi seseorang yang luar biasa.\r\nBagaimana cara saya mewujudkannya adalah saya berniat untuk mengikuti program volunteer yang menyelenggarakan forum ke luar negeri. Yang dengan itu saya sekarang juga sedang mempelajari terkait isu-isu SDGs dan memperdalam bahasa Inggris beserta menabung untuk keperluan tiket, visa, dan lain sebagainya apabila saya terpilih menjadi delegasi jalur fully funded. Dan tentunya, saya juga sedang berusaha apply beasiswa Youth Break the Boundaries, semoga akan ada jalan yang baik dan indah pada ujung ini semua :)\r\nApapun ketika saya sedang berusaha untuk mewujudkan mimpi-mimpi, jangan pernah membandingkan dirimu dengan orang lain karena tentu hal tersebut tidak adil dan tidak relevan. Setiap orang punya garis start dan caranya masing-masing. Fokus saja pada tujuan yang telah dirancang. Tidak perlu menjadi sehebat orang lain, kita hanya perlu menjadi lebih baik dari hari ke hari-setiap harinya. Selalu merasa apresiasi diri sendiri-apapun yang terjadi dan hasilnya. Sebab jika proses telah dilewati-apapun hasilnya, merupakan salah satu tanda bahwa jika kita tidak menyerah dan tetap berusaha maka kita adalah pemenang. Kita sudah menang.\r\nPada akhirnya, besar kecilnya mimpi bukan menjadi tolak ukur terkait bagaimana perjuangan yang harus dibayar. Sebab bagaimanapun juga, semua mimpi yang telah dibangun layak dan patut diperjuangkan. Kemudian, yang paling penting adalah apa esensi dari mimpi kita tersebut.\r\nApabila saya telah bermimpi, maka dengan itu saya memiliki tanggung jawab dan akan dengan senang hati saya berusaha untuk mencurahkan segala usaha, energi, dan antusiasme ke dalam mimpi yang telah saya rancang. Saya percaya bahwa hal tersebut-bagaimanapun pada akhir dan ujungnya akan tetap berbuah pengalaman yang mengubah hidup dan memungkinkan saya untuk menyebarkan dampak positif kepada banyak orang.\r\n\r\nSemesta, tolong bantu saya untuk bertahan lebih lama.',	'Pada waktu SMA kelas 2, saya tergabung ke dalam organisasi Lingkungan Hidup Club. Karena saya amat interest dengan lingkungan. Program-program yang ditawarkan kala itu pun amat sangat bermanfaat. Saya sebagai divisi hubungan masyarakat pernah menanam mangrove di pantai, bersih pantai yang waktu itu bekerja sama dengan UNNES, membuat hidroponik, mendaur ulang botol menjadi pot yang kemudian ditempel menjadi hiasan di dinding sekolah, luar biasa sekali rasanya.\r\nPada bulan November 2021 lalu, saya terlibat sebagai relawan ke sekolah luar biasa yang diadakan oleh Gapai Kebumen, yang diselenggarakan acaranya tersebut berada di SLB Karanganyar. Kegiatan dilaksanakan selama 3 hari dengan agenda pembelajaran kepada murid difabel, webinar bahasa isyarat dan terakhir ialah pertunjukan seni bersama. Di sana saya belajar banyak hal. Sungguh teramat sederhana memang, tetapi hal tersebut menggugah hati saya dengan teramat sangat. Para anak difabel yang saya maksud, tidak ada rasa suram yang ditunjukkan sekalipun, tidak ada pula rasa mengeluh yang dilontarkan sedikitpun. “Ah Erika, nikmat Tuhan mana lagi yang kamu dustakan?” batinku kala itu.\r\nMereka masih anak kecil, tapi mengapa sangat kuat? Barangkali itu bukti bahwa usia bukanlah tanda kedewasaan seseorang. Mereka hebat-sangat hebat. Mereka tidak membutuhkan validasi. Ah, aku perlu banyak belajar dari mereka.\r\nYa, manusia hidup dengan segala lebih dan kurangnya. Tidak ada yang patut disombongkan, sama sekali, ya kan?\r\nKemudian terkait pengalaman organisasi, untuk tahun 2022 ini saya menjadi bagian dari staff  Amnesty Indonesia di kajian lingkungan. Alasan saya bergabung ke dalam organisasi tersebut adalah pada tahun 2020 dulu, saya ingat betul pernah menuliskan “Kekerasan Seksual Yang Belum Jadi Soal di Senayan” ke Amnesty UNAIR. Tidak disangka, tulisan saya menjuarai 3 nasional dan dengan itu berkesempatan mendapatkan reward. Bersamaan dengan minat menulis saya terkait hak asasi manusia pula yang menjadikan saya melangkah tanpa ragu untuk turut berkontribusi di dalam organisasi ini.\r\nNamun, dikarenakan saya bergabung ke divisi lingkungan, dengan itu saya memperbanyak kajian lingkungan melalui matkul hukum lingkungan yang pernah saya ambil di semester tiga lalu. Dengan itu, saya diberi kepercayaan untuk menjadi penanggung jawab program kerja food estate yang rencana akan diadakan pada September 2022 ini.\r\nSelanjutnya berkenaan dengan hobi saya, yaitu menulis, maka di tahun 2022 saya bergabung ke dalam BEM UNAIR terkait Kesetaraan Gender Perempuan dan Anak divisi edukasi. Edukasi yang dimaksud dalam hal ini adalah memberikan informasi serta memberikan opini terkait isu-isu baik ketidaksetaraan gender maupun kasus kekerasan seksual yang sedang makin marak terjadi. Maka menimbang hal demikian, saya memilih terlibat dalam program pemagangan dari kampus, lembaga CLEP UNAIR selama 6 bulan, Dalam pemagangan tersebut saya bertugas untuk menjadi researcher dan mempublikasi jurnal nasional. Dalam pemagangan tersebut mengambil tema besar hak asasi manusia dimana saya bersama dengan teman saya mengambil sub tema terkait perkawinan anak di bawah umur ditinjau dari hukum adat dan masyarakat hukum islam berkaca dari self determination individu.\r\nKemudian, di BEM UNAIR-divisi Kesetaraan Gender Perempuan dan Anak, saya terlibat dalam kepanitiaan membuat policy brief terkait SOP anti kekerasan seksual (yang didiskusikan ke seluruh BEM fakultas UNAIR dan nantinya pada hari Rabu, 22 Juni 2022 akan ditunjukkan secara langsung ke pihak rektorat dan meminta pengesahan. Selain itu, ada pula program kerja yang telah dilaksanakan yaitu mengunjungi Dinas Pemberdayaan Perempuan, Perlindungan Anak dan Kependudukan Provinsi Jawa Timur untuk berdiskusi dalam kajian perlindungan perempuan dan anak.\r\nDi lain sisi, sekarang saya juga sedang menjadi staff ALSA (Asean Law Student Association) LC UNAIR dan menjadi staff english development. Saya sangat menyukai pelajaran bahasa Inggris. Terkadang di kehidupan sehari-hari saya menerapkan konsep bilingual. Bukan saya sudah mahir, akan tetapi dengan begitu saya harap banyak orang mengoreksi tatanan bahasa saya sehingga saya dapat berbicara lebih baik secara terus menerus. Di bulan Juni ini saya menjadi VPO (wakil penanggung jawab) terkait acara ALSA Dare to Speak, dimana akan ada kasus (Abortion right in US) dan saya sebagai moderator akan menghimbau para peserta untuk mengemukakan pendapatnya menggunakan bahasa Inggris. Saya merasa dengan bergabung di organisasi ini, selain dapat menampung passion saya yaitu menyukai pelajaran bahasa Inggris, juga meningkatkan kemampuan bahasa dan public speaking secara baik dan benar.\r\nSelain itu, untuk meningkatkan kemampuan bahasa Inggris saya adalah di semester satu saya pernah tergabung ke dalam  organisasi ILSA (International Law Student Association) UNAIR. Saya tergabung sebagai divisi Alumni Affairs. Saya terkoneksi dengan banyak alumni untuk membicarakan terkait webinar yang akan diselenggarakan. Pada waktu itu, saya dipercaya sebagai penanggung jawab acara How to Write Legal in English. Latar belakang saya mengadakan webinar tersebut adalah agar orang-orang, khususnya mahasiswa hukum dapat meningkatkan kemampuan menulisnya (legal opinion) dalam bahasa Inggris.',	1,	1655688481,	NULL,	0),
('SCHLR-RKYSP-920eb6',	'USR-RKYSP-f6c68',	'Euriko Yoseph',	'2002-12-16',	'81284718206',	'Jalan medan-binjai km. 13, Deli Serdang, Sumatera Utara - 20351',	'Ilmu Komunikasi',	'Universitas sri4',	'3.79',	'4',	'Saya adalah anak ketiga dari 3 bersaudara dan sedang menempuh pendidikan di jurusan Ilmu Komunikasi tepatnya pada semester 4. Saya memiliki sifat yang humble, jujur, bertanggung jawab dan tidak mudah menyerah. Saya memiliki hobi olahraga dan menonton film.',	'Mimpi saya ingin bersekolah di luar negeri dengan beasiswa dan menjadi pengusaha sukses di bidang properti. Cara saya mewujudkannya dengan belajar lebih giat agar mendapatkan beasiswa juga bekerja lebih keras dan mencari pengalaman sebanyak-banyaknya agar menjadi pengusaha properti.',	'Saat ini saya sedang mengemban tugas menjadi bendahara komisi satu Dewan Perwakilan Mahasiswa FISIP Universitas Sriwijaya. Dalam hal ini tupoksi saya mengatur anggaran kegiatan dalam komisi/badan yang saya emban. Komisi satu dalam organisasi ini bertugas menjadi pengawas dan penampung aspirasi mahasiswa dalam himpunan jurusan di lingkungan fakultas FISIP Universitas Sriwijaya. Dan saya juga menjadi anggota dalam himpunan mahasiswa jurusan di kampus, saya juga pernah menjadi anggota palang merah dan anggota basket di SMA.',	1,	1654510178,	NULL,	0),
('SCHLR-RLYZZ-9ea815',	'USR-RLYZZ-af197',	'Ar Auliya Azzahra',	'2002-01-06',	'85341660101',	'Perum Jawi-Jawi Pemai Blok C 35, Kelurahan Lapadde, Kecamatan Ujung, Kota Parepare, Sulawesi Selatan',	'Keperawatan',	'Universitas Hasanuddin',	'3.90',	'4',	'Saya Auliya dan saat ini saya merupakan mahasiswa keperawatan di Universitas Hasanuddin. Saya berasal dari keluarga yang bisa dibilang memiliki ekonomi lemah. Untuk itu saya berusaha untuk meringankan beban keluarga, salah satunya dengan mendaftar beasiswa. Dengan berbagai kesibukan yang ada sebagai mahasiswa, saya sangat berharap dapat menerima beasiswa untuk membantu biaya kuliah dan sehari-hari di kota perantauan yang tidaklah sedikit. Saya tidak ingin kondisi ekonomi menghalangi saya untuk meraih apa yang saya cita-citakan. ',	'Saya mempunyai banyak mimpi. Mimpi terbesar saya adalah membahagiakan keluarga dan orang-orang terdekat saya. Saya bercita-cita untuk menjadi seorang perawat dan menjadi orang yang bermanfaat bagi orang lain. Untuk menjadi seorang perawat professional ini, saya perlu memperkaya diri dengan ilmu dan keterampilan melalui pendidikan. Saya akan selalu berusaha untuk mengembangkan diri sehingga nantinya dapat menjadi perawat professional yang berkualitas dan dapat dibanggakan.',	'Iya, saya punya beberapa pengalaman organisasi. Sejak SMP-SMA saya mengikuti organisasi PMR karena memang sangat tertarik dengan kesehatan dan kemanusiaan. Ketertarikan saya ini berlanjut sampai ke kehidupan kampus. Saat ini saya mengikuti organisasi SIAGA NERS (Squad of Disaster and Emergency Assistance Ners) yang bergerak di bidang kebencanaan dan kegawatdaruratan. Saya pernah menjadi relawan khususnya sebagai tim medis dalam berbagai kejadian kebencanaan, kegawatdaruratan, dan kegiatan-kegiatan yang memerlukan tim medis. Selain itu, banyak program kerja yang sangat bermanfaat untuk masyarat, seperti bakti sosial, pemeriksaan kesehatan gratis, video edukasi, talkshow tentang berbagai penyakit, dan lain sebagainya.',	1,	1654366184,	NULL,	0),
('SCHLR-RMDN-7f6476',	'USR-RMDN-075270',	'Ramdani',	'2001-01-12',	'87818158493',	'Martapura lama km 12 RT 007 Sungai Tabuk',	'Management',	'Universitas lambung Mangkurat',	'3.77',	'6',	'I am management student who passionate about  taking an inisiative, community development, youth empowerment  and leadership, lately I have been working with my online community that i made  which focus on self management and improvement for young generation in Indonesia, and we give an access for those who want to enhance their self improvement and leadership skill for future, and we ambrace those young generation who is lacking of experience, skill, potency, lack of an access to quality education and improvement platform\r\n\r\nPreoviusly I was part of serval organization and community in college, It\'s been more than 5 years, learning with a lot of people with different backgrounds in many organizations and communities that help me to plan, organize, actuate, and control a community and it helps me a lot to adapt easily with people and to be more responsible, thoughtful, and wiser and as a person person who not always think about myself but giving something back for community  and to take an initiative for others \r\n\r\n\" because we don\'t have to be perfect to make an impact\"\r\n',	'my biggest dream is to make my community   even stronger and impact others especially in education field ( self improvement and management)\r\n\r\nin order to make my dream come true\r\ni have been working with my community, Ucoolwecool which focus on self management and improvement and embarrass those young generation who has lack of experience and leadership and anhace their a quality for the future, and now we open several free class for senior and junior high school, and we collaborate with 6 communities in Indonesia\r\n\r\nby join this program it\'s really in line with community and project that we made, it give me  an opportunity to learn to improve, explore, collaborate with others Within this program and improve my leadership skill so that I can make my community more sustainable\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n',	'1) Ucoolwecool as founder (september 9th 2021 - now) \r\n\r\n2) UC english academy as founder, ucooler english academy, (April 9th 2021 - now)\r\n\r\n3) Ucooler Academy as fasilitator, ucoolwecool (january 2022- now) \r\n\r\n4) sekolah pasar modal FEB ULM, anivest member, (2020-2021)\r\n\r\n5) himpunan mahasiswa manajemen, member, (2021-2022)\r\n\r\n6) LMDS, co-manager, ULM (2019- 2021)\r\n\r\n7) Adiwiyata, member, SMAN 1 Satui (2018 - 2019 )\r\n\r\n8) OSIS as Chairman of the Student Council, SMAN 1 Satui (2018 - 2019)\r\n\r\n9) English Club, President,  SMAN 1 Satui (2017-2019)\r\n\r\n\r\n\r\nit\'s such an amazing journey,and this journey help me a lot to be more wiser, resilient, determined and dedicated person so that\'s why it\'s been more 5 years Join and being a part of those community which help me to build my own community and impact others \r\n',	1,	1654759350,	NULL,	0),
('SCHLR-RMNDS-6a6e62',	'USR-RMNDS-d9dd9',	'Rimanda Syafitri',	'2003-06-16',	'81382820016',	'Perum Griya Asri Sukamanah 2 Blok D6 No.14 RT.005 RW.012, Kecamatan Rajeg, Kelurahan Sukamanah, Kabupaten Tangerang, Provinsi Banten, 15540.',	'Jurusan Akuntansi/Fakultas Eko',	'Universitas Sultan Ageng Tirta',	'3.58',	'1',	'Perkenalkan, nama saya Rimanda Syafitri tinggal di Kabupaten Tangerang, lahir pada tanggal 24 November 2003 di Kulon Progo. Saya sedang berkuliah di Universitas Sultan Ageng Tirtayasa, Jurusan S1 Akuntansi. Saya mempunyai cita-cita untuk menjadi seorang akuntan publik dan ingin bisa memberangkatkan kedua orang tua saya berangkat umroh. Saya anak ke 1 dari 2 bersaudara. Dimana kondisi ekonomi keluarga saya pengeluarannya cukup banyak, karena orang tua saya harus menyekolahkan adik saya yang tahun ini baru masuk Sekolah Dasar (SD), dan membayar rumah yang masih dalam tahap cicilan sekitar 8 tahun lagi. Oleh karena itu untuk meringankan beban orang tua saya, saya berharap dapat memperoleh beasiswa. Saya dalam bidang akademik pernah mengikuti berbagai lomba di tingkat nasional, dimana pada tahun 2020 saya mengikuti lomba dibidang Matematika, Biologi, dan Sejarah. Dimana pada bidang lomba sejarah, saya menduduki sebagai peserta 1000 terbaik. Tujuan saya mengikuti beasiswa ini yaitu, harapan saya supaya bisa meringankan orang tua dalam membiayai kuliah saya. Saya berkuliah mengambil jurusan Akuntansi karena saat masa sekolah saya senang sekali dengan hitungan. Selain masalah keuangan yang menjadi dorongan kuat saya dalam memperoleh biaya siswa, tetapi saya mempunyai minat serta bakat yang saya yakin bahwa saya mampu untuk berkuliah dengan baik dan dapat lulus dengan gelar sarjana yang mempunyai keahlian dalam bidang akuntansi.',	'Mimpi terbesar saya adalah ingin menjadi seorang akuntan publik. Cara saya untuk mewujudkan mimpi terbesar saya yaitu, saya harus rjin belajar dan lebih mengasah skill, dengan mempelajari berbagai jurnal dalam akuntansi. Supaya ketika sudah terjun ke dunia pekerjaan, saya bisa mengimplementasikan apa yang sudah saya pelajari semasa kuliah.',	'Saya mempunyai pengalaman organisasi saat Sekolah Menengah Atas (SMA). Oganisasi yang saya ikuti yaitu, English Club. Dimana dalam organisasi yang saya ikuti, saya pernah ditunjuk oleh pembina sebagai ketua acara kegiatan pada hari dilaksanakannya organisasi itu. Yang mana pada hari tersebut kegiatan organisasi yang saya ikuti, saya dapat memberikan berbagai materi yang saya berikan kepada audience dan memberikan suatu hiburan atau permainan agar acara yang dilaksanakan tidak terlalu menegangkan para audience dalam menerima materi yang saya berikan.',	1,	1655339567,	NULL,	0),
('SCHLR-RMSSP-c1700c',	'USR-RMSSP-6f43d',	'Ramses Parningotan Panjaitan',	'1999-04-28',	'85171028044',	'Jl Cipto Mangunkusumo GG 2',	'Jurusan Filsafat Budaya/ Filsa',	'SMA N 7 Samarinda',	'0',	'0',	'Jadi saya termasuk anak yang suka buku-buku perjuangan sejak SMA saat itu ada beberapa buku dirumah dan saya mencoba membacanya. Buku catatan seorang demonstran dan orang-orang di persimpangan kiri jalan pemikiran Gie. Lalu pemikiran Che Guevara revolusioner kuba. Pemikiran pak Pram dan lanjut ke pemikiran para filsuf Yunani kuno dan modern seperti Thales, Socrates, Plato, Aristoteles, seneca lanjut ke modern ada Immanuel kant lalu Fredrich Nietzsche',	'Jadi saya memiliki keinginan untuk menjadi seorang penulis, novelis, juga seorang budayawan, kontent kreator yang bersifat akademisi lalu menjadi tenaga pengajar yaitu dosen. Untuk mencapai itu maka saya akan memperdalami ilmu pengetahuan dari yang dasar. Seperti membaca, mengikuti lomba kepenulisan, mengikuti komunitas dll.',	'Iya saya tergabung dalam 5 komunitas jadi founder, lalu jadi admin pemateri puisi lalu sebagai member',	1,	1654163228,	NULL,	0),
('SCHLR-RMSTK-baa873',	'USR-RMSTK-2f92a',	'Era Mustika Ginting',	'2001-11-06',	'82286365391',	'Jl. Nusa indah Gg. Melati veteran pasar 8',	'ilmu ekonomi',	'universitas negri medan',	'3.40',	'2',	'Perkenalkan saya Era Mustika Ginting tinggal di kota Medan, lahir pada tanggal 06 November 2001. saya kuliah di Universitas Negri Medan dengan jurusan Ilmu Ekonomi. Saya anak pertama dari 6 bersaudara dimana kondisi ekonomi cukup berat bagi keluar karena orang tua harus menyekolahkan 3 saudara, oleh karena itu untuk meringankan orang tua saya berharap dapat memperoleh beasiswa. Saya pernah mengikuti lomba akuntansi saat masih smk dan lomba kelompok matematika di unimed. Harapan yang paling penting mengikuti beasiswa ini adalah bisa meringankan beban orang tua yang dimana untuk membayar uang kuliah.',	'Mimpi terbesar saya adalah melihat orang tua bahagia dan menjadi orang yang berguna bagi orang banyak.',	'Selama kuliah saya aktif di organisasi UKMI (Unit Kegiatan Mahasiswa Islam) . Saya sebagai staf di bidang psdm  yaitu bidang pengembangan sumber daya manusia  kegiaatan, pelatihan dan juga upgrading skill untuk anggota. Tujuan saya ikut organisasi adalah selain melatih softskill dan leadship, juga sebagai ajang untuk berbagi ilmu yang sudah dapatkan dan sudah saya terapkan.',	1,	1654323808,	NULL,	0),
('SCHLR-RMSTY-2ebc32',	'USR-RMSTY-3a9a5',	'Arum Setyowati',	'2002-10-23',	'895807745577',	'Jalan Raya Lengkong Desa Bukur RT 05 RW 01 Kecamatan Patianrowo Kabupaten Nganjuk Jawa Timur',	'Fisika/Fakultas Sains dan Anal',	'Institut Teknologi Sepuluh Nop',	'3.67',	'4',	'Saya Arum Setyowati dengan usia 20 tahun. Sekarang saya adalah mahasiswi semester 4 Fisika Institut Teknologi Sepuluh Nopember. Kelebihan saya adalah saya orang yang bertanggung jawab, disiplin, jujur, menyukai hal baru dan teliti.  Sedangkan kekurangan saya adalah kurang bisa percaya kepada orang baru dikenal. Namun, untuk mengatasi hal tersebut saya akan mencoba berinteraksi dengan orang terkait dan lebih kenal lagi.',	'Mimpi terbesar saya adalah pertama meraih cita-cita saya dan membahagiakan kedua orang tua. Kedua adalah menjadi orang yang bermanfaat bagi orang lain. Cara saya mewujudkan impian pertama saya yaitu dengan tekun belajar dan aktif baik dalam akademik dan non akademik serta terus meningkatkan skill yang saya punya dan juga tidak lupa terus berdoa kepada Allah SWT. Untuk mewujudkan impian kedua saya, yaitu dengan mengikuti beberapa kegiatan yang berhubungan dengan bidang masyarakat dan terus belajar serta mengabdi seperti ikut KKN yang berhubungan dengan hal tersebut, membantu orang lain yang sedang dibutuhkan, dan terus berusaha belajar hal baru dan membaginya ke semua orang.',	'Iya saya mempunyai organisasi yaitu sekarang pertama, saya menjabat sebagai bendahara UKM Bridge ITS dimana disini saya diamanahi untuk mengatur keuangan baik pengeluaran dan pemasukan serta membuat Laporan Pertanggungjawaban. Kedua, saya menjadi sekretaris departemen Ukhuwah Usaha di bidang Forum Studi Islam Fisika dimana disini saya diamanahi untuk membuat proposal dan menjadi notulensi dalam kegiatan. Ketiga, saya juga menjadi Student Ambassador di Rumah Penalaran dimana disini saya diamanahi untuk membagikan postingan postingan yang berkaitan dengan KTI, essay, dan beasiswa ataupun lainnya.',	1,	1655740447,	NULL,	0),
('SCHLR-RMTYS-af754f',	'USR-RMTYS-5aeb1',	'Arumtyas Pambajeng ',	'2006-03-01',	'89505090332',	'Palur RT 14 RW 003, Kebonsari, Madiun, Jawa Timur ',	'IPA',	'Sma Negeri 1 Geger',	'9.20',	'3',	'Perkenalkan, nama saya Arumtyas Pambajeng. Usia saya 16 tahun dan saat ini berdomisili di Kabupaten Madiun. Saya bersekolah di SMA Negeri 1 Geger, sekarang saya sudah kelas 11 semester 1. Saya adalah siswa akselerasi yang menempuh pendidikan SMA selama 2 tahun. Sebelum resmi menjadi siswa akselerasi, saya aktif sebagai Majelis Perwakilan Kelas (MPK) untuk kelas 10 MIPA 3. Di SMP dahulu, saya juga aktif sebagai anggota OSIS bidang Kepribadian dan Budi Pekerti. Selain itu, saya juga aktif sebagai anggota Forum Anak Kabupaten Madiun sejak 2021, sebagai anggota divisi 1, Hak Asasi dan Kebebasan. Saya juga aktif menulis dan menghasilkan berbagai karya seperti puisi, cerita pendek. Keaktifan saya dalam setiap kegiatan, tentu tidak lepas dari peran orang tua dalam mendidik saya. Saya terbiasa bangun pukul 03.15 dan mandi terlebih dahulu lalu salat tahajud. Saya juga diberi kewajiban untuk mencuci piring sebelum memulai aktivitas sehari-hari. Kebetulan, rumah saya juga dekat dengan mushola, sehingga saya diberi kewajiban untuk menyapu sebelum disiapkan untuk salat magrib. Hal-hal kecil inilah yang mengantarkan saya hingga saat ini.',	'Sesungguhnya, akar dari semua permasalahan yang ada di Indonesia adalah pendidikan yang kurang merata  Baik dari segi akademis maupun moral. Mimpi terbesar saya adalah bisa membantu atau setidaknya memberikan pendidikan yang layak kepada orang-orang disekitar saya, itu adalah langkah kecil yang mungkin bisa terus saya kembangkan jangkauannya. Mengingat saya tumbuh di desa dan kualitas sumber daya manusia masih sangat rendah, hal itu tidak jauh berbeda dengan daerah-daerah lain di Indonesia. Harapan saya, dikemudian hari, beasiswa ini bisa membantu saya untuk berkembang dan semakin bermanfaat untuk diri sendiri dan orang-orang disekitar saya terutama. Saat diri sendiri sudah mulai membaik, tentu hal itu bisa saya sebarkan manfaatnya dengan jangkauan yang lebih besar.',	'Pengalaman Organisasi saya dimulai sejak Madrasah Ibtidaiyah (MI) memang bukan organisasi resmi, akan tetapi sekolah mengajarkan kami mengatur event-event yang diadakan pihak sekolah, kami juga membantu mengatur para adik kelas demi terselenggaranya kelancaran kegiatan, saya adalah anggota bagian bahasa yang mengatur kewajiban berbahasa arab atau inggris di dalam kelas bagi kelas 5 dan 6, jadi sedikit basic bahasa arab dan inggris saya sudah kuasai. Menginjak bangku SMP, saya menjadi anggota OSIS di kelas 7 sebagai Seksi Bidang Ketakwaan Kepada Tuhan Yang Maha Esa, hingga pada kelas 8 terpilih lagi menjadi anggota OSIS sebagai Ketua Seksi Bidang Budi Pekerti Luhur, sebagai ketua sekbid budi pekerti, saya ikut berpartisipasi mengatur kelengkapan atribut siswa/i di sekolah, setiap pagi akan ada petugas yang menjaga gerbang mengecek kelengkapan atribut. Saat menjabat sebagai OSIS di kelas 8, OSIS angkatan kami mengadakan event besar yaitu Diesnatalis atau Ulang Tahun Sekolah, Alhamdulillah acara berjalan lancar. Singkat cerita, saya masuk SMA di tahun 2021, saya terpilih sebagai Anggota Forum Anak Kabupaten Madiun divisi Pemenuhan Hak Sipil dan Kebebasan, kami turut berpartisipasi dalam pemenuhan hak-hak anak dengan giat mengisi aspirasi suara FAJAR pada tahun 2022. Sebelum resmi dilantik sebagai Anggota FORAKMA, pada saat Bulan Ramadhan, kami para Anggota Forakma melakukan kegiatan berbagi dan bermain di Panti Asuhan Luar Biasa di Kec. Wungu. Tidak hanya itu, pada tanggal 2 Juni kemarin, 10 Anggota FORAKMA termasuk saya, menghadiri Verifikasi Kabupaten Layak Anak di Pusat Pemerintahan Kab. Madiun di Caruban. saya juga resmi diterima sebagai Anggota MPK (Majelis Perwakilan Kelas) di SMA, saya  di komisi satu bersama rekan satu komisi, menampung aspirasi dari warga sekolah dan menyalurkan kepada pihak sekolah maupun OSIS, kami sudah menyelenggarakan SUMPS(Sidang Umum Majelis Permusyawaratan Siswa) pada November 2021 dan STT ( Sidang Tengah Tahun) pada Februari 2022 lalu.',	1,	1655724815,	NULL,	0),
('SCHLR-RMWT-048bf8',	'USR-RMWT-db29a8',	'Irmawati',	'2003-03-29',	'895332642926',	'Pabuwaran, Puwokerto Utara',	'Agribisnis/Pertanian',	'Universitas Jenderal Soedirman',	'3.57',	'2',	'Saya seorang mahasiswi prodi Agribisnis angkatan 2021 yang berasal dari keluarga sederhana namun saya memilik cita-cita besar untuk bangsa ini. Salah satu cara adalah menjadi pelajar yang berprestasi kapanpun dan dimanapun. Sehingga tercipta generasi penerus bangsa yang berkualitas di bidangnya.',	'Memperbaiki dan memajukan bangsa ini dengan menjadi mahasiswa yang berprestasi dan kritis sehingga bangsa ini mampu bersaing dengan lebih siap. Kekurangan yang dihadapi bangsa ini adalah infrastruktur dari SDA nya, sehingga dengan peningkatan kualitas SDA secara tidak langsung akan meningkatkan kemajuan bangsa ini.',	'Sedang mengikuti kepengurusan dan kepanitiaan UKM dan organisasi di universitas. Sebenarnya ini adalah pengalaman pertama saya, karena sebelumnya ketika di SMA saya kurang aktif. Namun saya ingin ada perubahan dalam hidup saya ke arah yang lebih baik. Pemuda adalah agen of change, dan organisasi merupakan media kita untuk berlatih sebelum kita benar-benar terjun di masyarakat.',	1,	1655478628,	NULL,	0),
('SCHLR-RNDKR-569a37',	'USR-RNDKR-8c093',	'Rendi Kurniawan',	'2004-09-13',	'81379201690',	'Pauh, Jorong Koto Gadang Hilir. Kecamatan Padang Ganting, Kabupaten Tanah Datar, Provinsi Sumatera Barat',	'Statistika/Matematika dan Ilmu',	'Universitas Negeri Padang',	'0.00',	'1',	'Saya baru site si jurusan Statistika Universitas Negeri Padang. Saya adalah seorang yang sangat menyukai hal-hal yang berbaur dengan angka-angka dan hitung-hitungan. Saya adalah seorang yang sangat menyukai pelajaran yang mempelajari cara mengumpulkan, menganalisis, dan menyajikan data ke dalam bahasa yang mudah dipahami ke dalam bentuk diagram, tabel, maupun grafik sehingga bisa dijadikan sebuah informasi untuk banyak orang. Maka dari itu saya mengambil jurusan Statistika ini.',	'Mimpi saya adalah menjadi ahli statistik yang berguna untuk masa depan bangsa Indonesia. Cara mewujudkanya adalah dengan saya bersungguh sungguh dalam menjalankan kuliah Saya. Saya akan aktif dalam beberapa organisasi agar mendapat pengalaman yang bermanfaat bagi saya dan untuk pekerjaan saya bagi masa yang akan datang.',	'Iya, ada. Saya mengikuti organisasi OSIS dan mengikuti kegiatan sampah bersih. Kegiatan tersebut bertujuan untuk menjadikan SMA saya menjadi sekolah Adiwiyata dan menjadikan sekolah saya menjadi sekolah yang nyaman, bersih, dan indah untuk dipandang. Kegiatan itu dilakukan dengan mengumpulkan sampah tiap kelas dan sampah tersebut digolongkan menjadi sampah organik dan anorganik setelah itu ditimbang dan dijual kepada pengumpul. Dan uang Hasil penjualan diberikan kembali kepada kelas yang menyetorkan sampah tadi. Hasil penjualan sampah tersebut dijadikan data dalam bentuk diagram tabel maupun grafik agar bisa mudah dipahami, dibaca, dan bermanfaat bagi banyak orang. ',	1,	1653710241,	NULL,	0),
('SCHLR-RNDKR-96d675',	'USR-RNDKR-75705',	'Rendi Kurniawan',	'2004-09-13',	'81379201690',	'Pauh, Jorong Koto Gadang Hilir. Kecamatan Padang Ganting, Kabupaten Tanah Datar, Provinsi Sumatera Barat.',	'Statistika/Matematika dan Ilmu',	'Universitas Negeri Padang',	'0.00',	'1',	'Saya baru diterima di jurusan Statistika Universitas Negeri Padang. Saya adalah seorang yang sangat menyukai hal-hal yang berbaur dengan angka-angka dan hitung-hitungan. Saya menyukai pelajaran yang mempelajari cara mengumpulkan, menganalisis, dan menyajikan data ke dalam bahasa yang mudah dipahami dalam bentuk diagram, tabel, maupun grafik sehingga bisa dijadikan sebuah informasi untuk banyak orang. Maka dari itu saya mengambil jurusan Statistika ini.',	'Mimpi saya adalah menjadi ahli statistik yang berguna bagi masa depan bangsa Indonesia. Cara mewujudkanya adalah dengan saya bersungguh sungguh dalam menjalankan kuliah Saya. Saya akan aktif dalam beberapa organisasi agar mendapat pengalaman yang bermanfaat bagi saya dan untuk pekerjaan saya bagi masa yang akan datang.',	'Iya, ada. Pernah mengikuti OSIS dan kegiatan sekolah seperti mengumpulkan sampah Bersih. Kegiatan tersebut bertujuan untuk menjadikan SMA saya menjadi sekolah Adiwiyata, dan manjadi sekolah yang nyaman, bersih, dan indah untuk dipandang. Kegiatanya dilakukan dengan cara mengumpulkan Sampah tiap kelas dan digolongkan terlebih dahulu sampah tersebut menjadi organik dan anorganik. Setelah itu ditimbang dan dijual kepada pengumpul. Dan uang hasil penjualan tersebut uangnya dikembalikan kepada kelas yang menyetorkan sampah tadi. Hasil penjualan tersebut dijadikan data dalam bentuk diagram tabel maupun grafik agar bisa mudah dipahami, dibaca, dan bermain bagi banyak orang.',	1,	1653695612,	NULL,	0),
('SCHLR-RNGGD-908dc1',	'USR-RNGGD-c6a26',	'Rangga Adi Firmansyah',	'2003-05-20',	'81358751356',	'Jln Raya Proppo, Kecamatan Proppo, Kabupaten Pamekasan, Jawa Timur',	'Manajemen',	'Universitas Negeri Yogyakarta',	'3.68',	'2',	'saya adalah pribadi yang ambisius. selain itu saya adalah pribadi yang melihat sesuatu dari berbagai macam sudut pandang dan hal tersebut saya jadikan sebagai alat untuk meminimalisir resiko dari setiap kebijakan ataupun keputusan yang akan saya buat dalam kehidupan saya. selain itu saya juga suka bekerja sama dan membaur bersama teman-teman baru. selain itu saya juga orang yang tipe bekerja keras dan suka membantu antar teman ketika mereka tidak bisa dalam beberapa matkul. ',	'mimpi terbesar saya adalah untuk menjadi seorang pengusaha yang memiliki impact yang besar. bukan hanya profit melainkan kebermanfaatan bagi masyarakat luas adalah salah satu kunci dalam mencapai cita-cita saya. alat untuk mencapai cita-cita tadi adalah tentunya dengan belajar sungguh-sungguh artinya dengan saya yang belajar dalam prodi manajemen hal itu secara tidak langsung akan menjadi model bagi saya untuk menjadikannya ilmu yang bermanfaat agar proses pengembangan bisnis nantinya akan berhasil dan dapat meminimalisir resiko.',	'pengalaman organisasi saya terdiri dari berbagai macam diantaranya adalah OSIS dengan berbagai macam event yang digelar di sekolah baik itu regional maupun nasional. selain itu saya juga seorang pencinta alam di mana kami bersama tim mengeksplorasi berbagai macam tempat untuk menikmati keindahan alam sembari melakukan campaign untuk menjaga alam dan kelestarian lingkungan. saya juga merupakan anggota dari ekonomi klub yang ada di sekolah saya. dengan hal tadi saya dapat mengantarkan sekolah saya untuk mencapai tingkat provinsi maupun tingkat nasional dalam berbagai macam kejuaraan mata pelajaran ekonomi. ',	1,	1655699429,	NULL,	0),
('SCHLR-RNGGN-c70e3c',	'USR-RNGGN-44a9d',	'Rengganis Virna Hartari',	'2001-05-25',	'85695515425',	'Megasentul jl. Bougenville 15 blok p no 16 rt 08 rw 07 kab. Bogor',	'Pendidikan Kesejahteraan Kelua',	'Universitas Negeri Jakarta',	'3.89',	'4',	'perkenalkan nama saya Rengganis Virna Hartari saya berasal dari kota Bogor. saat ini saya sedang menempuh perkuliahan semester 4 di Universitas Negeri Jakarta kini, saya tengah fokus aktif dalam perkuliahan dan mengikuti organisasi serta kepanitiaan. saya memiliki pengalaman bekerja menjadi waitress di resto boogie desert bogor dan saya juga pernah bekerja di kaka baby shop sebagai pelayan/pramuniaga toko. after saya bekerja saya memutuskan untuk memilih melanjutkan kuliah di Universitas Negeri Jakarta dalam prodi Pendidikan Kesejahteraan Keluarga Fakultas Teknik. dalam perkuliahan saya belajar untuk banyak tugas dan mata kuliah serta saya juga belajar dalam beroganisasi serta kepanitiaan. organisasi pertama yang saya pilih yaitu Komunitas Sosial Pecinta Anak yang dimana saya berkontribusi untuk membuat platform serta media donasi untuk anak-anak TK Komunitas KSPA yang berlatarbelakang dari keluarga Pra-Sejahtera. dan saya juga mengikuti beberapa kepanitiaan dan berkontribusi dalan divisi-divisi tertentu yaitu dalam divisi acara dan HPD. dan sampai saat ini saya memutuskan untuk pindah ke organisasi lain yaitu organisasi keislaman yang bernama FSI-Al biruni dalam departement Annisa dan dalam departement annisa ini sudah membuat beberapa program seperti menyebarkan postingan muslimah bermanfaat serta membuat kajian kemuslimahan. selain daripada itu saya juga aktif mengikuti seminar/webinar jika ada acara-acara tertentu saya luangkan waktu untuk mengikutinya untuk menambah wawasan dan ilmu bagi saya.',	'mimpi terbesar saya yaitu saya ingin membuat pondok pesantren Al-Quran dan membuat beasiswa untuk anak-anak yang memiliki semangat dalam mempelajari ilmu agama. namun, memiliki keterbatasan ekonomi. untuk mewujudkannya yaitu melalui ikhtiar dan berdoa.. karena, segala sesuatu ikhtiar apapun dan sebesar apapun ikhtiar kita jikalau tidak atas izin dari Allah SWT semua tidak akan terlaksana. yang pasti semoga niat baik akan mendatangkan hal baik pula. aamiin dan juga hakikat saya membangun sebuah pondok pesantren ini yaitu untuk amal jariyah saya ketika di akhirat dikarenakan saya hanyalah menusia biasa yang penuh dengan dosa. maka dari, saya ingin menebarkan manfaat untuk banyak orang dan untuk diri saya sendiri dengan insyaAllah bismillah dari hasil kerja keras saya nanti dan atas izin yang maha kuasa Allah SWT semoga terwujud. ',	'saya memiliki pengalaman berorganisasi dahulu saat saya menginjak SMA saya mengikuti organisasi Rohani Islam selama 3 tahun dari organisasi tersebut kegiatan saya yaitu seperti mentoring, kajian, mabit, dan lain sebagainya. dan saya juga pernah mengikuti organisasi tari tradisional selama 1 tahun namun, tidak melanjutkan lagi karena ketika sudah mau pentas diperintahkan untuk membayar baju pentas namun, karena keterbatasan ekonomi keluarga saya waktu itu saya jadi tidak melanjutkannya lagi. lalu di kampus saya mengikuti kelompok sosial pencinta anak yang dimana saya ngajar anak TK yang berasal dari keluarga pra-sejahtera, dan juga saya mengikuti FSI AL-Biruni yaitu organisasi keislaman yang menyebarkan kebaikan dan membuat acara kajian dan lain sebagainnya. ',	1,	1654312519,	NULL,	0),
('SCHLR-RNKPS-67a086',	'USR-RNKPS-fcdc5',	'Rani Eka Puspita ',	'2001-10-22',	'82286209671',	'Jl. Kopi, Sumber Agung, Rimbo Ilir, Tebo, Jambi',	'Farmasi',	'Universitas Andalas',	'3.7',	'4',	'Saya adalah anak pertama dari dua bersaudara. Saat ini saya merupakan seorang mahasiswi jurusan Farmasi di Universitas Andalas. Saya seorang yang sangat tertarik di bidang research dan entrepreneur. Saya berkeinginan untuk mengeksplorasi kekayaan alam yang melimpah di Indonesia untuk pengembangan industri pengobatan dan kesehatan.',	'Tujuan jangka pendek saya saat ini yaitu, dapat berperan aktif di organisasi dikampus saya, sehingga mendapat banyak relasi yang berguna untuk masa depan nantinya, dan lulus cumlaude tepat waktu 3,5 tahun dan mengambil profesi apoteker tepat waktu. Untuk jangka menengah, saya ingin melanjutkan kuliah S2, kemudian mendapat pekerjaan pertama saya, yaitu bekerja di BPOM dan LIPI untuk melakukan penelitian. Tentunya untuk mencapai tujuan menengah ini harus mencapai tujuan jangka pendek tadi. Saya ingin menjadi orang yang bermanfaat bagi orang sekitar saya. Saya ingin mendirikan industri obat dan kosmetik untuk membuka lapangan pekerjaan untuk orang lain seperti yang saya ketahui bahwa banyak lulusan SMK/D3 bahkan S1 farmasi yang menganggur, hal ini saya lakukan untuk mengurangi angka pengangguran di indonesia. Dan untuk tujuan jangka panjang saya, saya ingin membuat ayah ibu saya bangga dengan saya, selalu tersenyum dan membahagiakan mereka berdua. Tentunya segala tujuan saya untuk mendapatkan Ridho Allah SWT.',	'Iya, saya memiliki pengalaman organisasi\r\nSaat tahun pertama kuliah, saya mengikuti magang organisasi di DPM-Revolutioner 10th. Kemudian di tahun kedua kuliah saya melanjutkan ilmu organisasi yang telah saya dapatkan di DPM KM Farmasi Unand dengan menjabat sebagai anggota Komisi Legislasi.',	1,	1655720245,	NULL,	0),
('SCHLR-RNLLN-28d911',	'USR-RNLLN-4d40a',	'Arnal Langgene',	'2001-09-06',	'82259165101',	'Desa Labangun',	'Pendidikan Fisika',	'Universitas Tadulako',	'3.96',	'4',	'Nama saya Arnal Langgene Umur 20 Tahun dan Sekarang Kuliah di Universitas Tadulako Pendidikan Fisika. Selama perkuliahan saya mengikuti organisasi HIMAFI Himpunan Mahasiswa Fisika dan Berbagai event kompetisi seperti KNMIPA, NUDC, KDMI, dan PILMAPRES. Dalam kegiatan tersebut saya beberapa kali mendapatkan juara dan mewakili Universitas Tadulako. Saya Mahasiswa Semester 4 dengan IPK 3.96 dan Saya merupakan Asisten Laboratorium Fisika FKIP UNTAD',	'Mimpi terbesar saya adalah bisa melanjutkan Pendidikan S2 di luar negeri. Dan Cara saya untuk mewujudkannya adalah memperdalam pengetahuan tentang Cara BerBahasa Inggris dan Mengikuti Beasiswa Luar Negeri ',	'Yah Pengalaman saat Organisasi HIMAFI Himpunan Mahasiswa Fisika dan ikut terlibat dalam program kerja HIMAFI dalam kepanitiaan misalnya dalam program kerja Fisika Mengabdi dimana kami memberikan bantuan kepada anak di panti asuhan dan masyarakat sekaligus dengan pembelajaran berbasis MBKM Merdeka Belajar Kampus Merdeka',	1,	1655057940,	NULL,	0),
('SCHLR-RNSDS-858cfc',	'USR-RNSDS-0225c',	'Auranisa Destya Primadiani',	'2003-10-29',	'81285938355',	'Jl.Klampis Ngasem No.73, Klampis Ngasem, Kota Surabaya, Jawa Timur',	'Teknik Geofisika',	'Institut Teknologi Sepuluh Nop',	'3.98',	'2',	'Saya orang nya sangat ambisius, sering menggunakan otak kiri tetapi otak kanan juga lancar dalam bidang desain. Pelajaran yang saya sukai yaitu fisika, saya mencintai bumi ini dan ingin menghubungkan dengan ilmu fisika. Maka dari itu saya ambil jurusan Teknik Geofisika. Semasa saya SMA saya mendapatkan program akselerasi dari sekolah saya sehingga hanya SMA 2 tahun saja, lulus lalu diterima kampus ITS dengan jurusan Teknik Geofisika. ',	'Mimpi terbesar saya bisa lulus dari ITS dengan IPK yang >3,5. Saya juga menantang diri saya agar lulus 3,5 tahun saja, dengan usaha saya yang semaksimal mungkin bisa saya lakukan. Dengan harapan saya seperti itu saya harus menangani kendala saya saat kuliah seperti memaksimalkan belajar saya, keaktifan saya di kampus, dan keluar dari zona nyaman saya. ',	'Selama saya di kampus saya mengikuti organisasi yaitu SPE ITS(Society of Petroleum Engineers ITS) dan UKM Archery ITS',	1,	1655743597,	NULL,	0),
('SCHLR-RNTDW-e70fbc',	'USR-RNTDW-f0f78',	'Renita Dwi Wicahyani',	'2005-05-03',	'895704453249',	'Pagelaran 1, Jl. Blitar No.16 RT/RW : 002/001, Kec. Pagelaran, Kab. Pringsewu, Lampung.',	'XI MIPA',	'SMA N 1 PRINGSEWU',	'3.00',	'4',	'Saya Renita. Saya adalah manusia dengan berjuta mimpi dan ambisi untuk mewujudkan mimpi-mimpi saya. Saya duduk di bangku SMA tepatnya kelas XI MIPA. Pelajaran favorit saya selalu berubah-ubah setiap jenjang kelas nya naik satu tingkat. Pada saat kelas X, saya suka pelajaran biologi. Dan saat kelas XI sekarang ini, saya menyukai pelajaran fisika dan kimia. Saya selalu berusaha dan bertekad agar mendapatkan nilai jauh di atas KKM. Saya memiliki tekad yang kuat yang mengharuskan saya untuk mendapatkan nilai yang bagus di kelas. Saya adalah sosok ambivert yang bisa mendengarkan pendapat lain tapi juga suka mengeluarkan banyak pendapat. Saya suka belajar sendirian atau pun belajar berkelompok bersama-sama, belajar dengan siapa pun tidak masalah buat saya. Saya dapat mengondisikan sikap saya tergantung lawan bicara yang saya hadapi. Saya senang bertemu dengan banyak orang tetapi terkadang saya juga memilih sendiri untuk menenangkan hati dan pikiran.  Saya juga merupakan sosok pribadi bertanggung jawab pada hal apapun yang sudah orang lain amanahkan kepada saya. Pintar memanajemen waktu adalah salah satu kelebihan favorit saya. Selain itu, seorang Renita tentunya juga memiliki kekurangan. Salah satu kekurangan yang saya miliki dan yang paling saya benci adalah pelupa dan terlalu cepat menyimpulkan suatu hal. Untuk itu, saya berusaha meminimalisir sifat pelupa saya dengan cara mencatat tugas-tugas yang belum saya kerjakan dan apabila sudah dikerjakan maka akan saya beri tanda ceklis. Selanjutnya, untuk menghilangkan sikap terlalu cepat menyimpulkan sesuatu, saya saat ini selalu mencermati secara detail setiap sesuatu yang saya baca, lihat dan dengar serta bertanya apabila ada hal yang belum jelas agar tidak cepat menyimpulkan sesuatu hal.',	'Mimpi terbesar saya adalah bisa sekolah setinggi mungkin dan dapat bekerja untuk negara. Tentunya, untuk menggapai mimpi tersebut tidaklah mudah. Banyak tantangan dan rintangan yang harus saya lalui bahkan mulai dari sekarang. Saya harus belajar lebih giat karena pada akhirnya saingan saya bukan hanya satu kelas, satu sekolah, satu kabupaten atau satu provinsi tetapi se-Indonesia. Tidak hanya belajar dalam bidang akademik saja, tetapi saya juga mengikuti kegiatan belajar non akademik yang disediakan oleh sekolah tentunya untuk menambah nilai keterampilan dan membantu nilai akademis. Mulai mencari informasi-informasi penting terkait dengan cita-cita saya atau hal/kegiatan yang dapat membantu saya untuk mewujudkan cita-cita saya serta mengembangkan bakat lalu mempraktikkan nya di kehidupan sehari-hari.',	'Pada saat ini saya menjabat menjadi Penanggung Jawab Organisasi English Club SMA N 1 Pringsewu khususnya cabang Speech. English Club merupakan wadah organisasi yang ditujukan kepada seluruh siswa/i yang memiliki bakat dalam bidang bahasa Inggris dan mau mengembangkan bakatnya ke jenjang lebih lanjut atau yang ingin mengenal dan ingin mempelajari hal-hal terkait bahasa Inggris. English Club memiliki 5 cabang, ada Speech, Storytelling, Debate, Newscast dan Scrabble. Khusus Speech, di cabang ini dipelajari cara berpidato menggunakan bahasa Inggris dengan tujuan menyampaikan argumen-argumen dan menyampaikan informasi kepada audiens. Melalui kelas Speech ini, diharapakan para member dapat berani berbicara di depan umum dan melatih kepercayaan diri untuk dapat tampil di depan umum, melatih daya ingat dan mengembangkan kreatifitas dalam mengembangkan kata-kata. Saya sudah berpengalaman untuk tampil di atas panggung sekolah pada acara Hari Batik Nasional dengan membawakan speech yang berjudul \"Batik\'s Day\". Selain itu, saya juga menjadi translator pada acara event bazar English Day walaupun masih banyak yang butuh di revisi pronounce nya serta saya juga pernah mengikuti English National Competition cabang Speech.',	1,	1653485050,	NULL,	0),
('SCHLR-RNTTM-acbdbe',	'USR-RNTTM-943ab',	'Arnetta Maharani',	'2003-11-06',	'81334522485',	'Jl Raya Sarangan no 390 rt 15 rw 02',	'Kesehatan Masyarakat',	'Universitas Diponegoro',	'0.00',	'mahasiswa ',	'\r\nNamaku Arnetta Maharani. Lahir di Magetan 6 November 2003. aku adalah anak pertama dari tiga bersaudara, buah dari pasangan Sumono dan Julie Mindarwati. Arnetta adalah panggilan akrabku. Aku terlahir di keluarga yang sangat sederhana, Ayahku seorang sopir sedangkan Ibuku bekerja sebagai wiraswasta. \r\nKetika berumur 7 tahun, aku memulai pendidikan di SDN Plaosan 1, kemudian setelah lulus aku melanjutkan pendidikanku di SMPN 1 Plaosan. Selepas lulus dari SMP, aku melanjutkan pendidikanku di SMAN 3 Magetan\r\nKetika menginjak kelas XI SMA, aku terpilih menjadi perwakilan KSN Kimia tingkat Kabupaten/Kota. Tentu saja ini membuat hatiku senang dan semakin bersemangat dalam belajar. Selain itu ia juga aktif dalam berbagai kegiatan di sekolah, aku bergabung dengan organisasi Karya Ilmiah Remaja dan Komunitas komputer disana aku mempelajari beberapa hal, contohnya menyusun karya ilmiah dan menguasai aplikasi pada komputer.\r\nSaat ini aku sudah lulus dan diterima di Universitas Diponegoro Jurusan Kesehatan Masyarakat Jalur SNMPTN.',	'Menjadi seseorang yang sukses sehingga dapat memperbaiki ekonomi dalam keluarga caraku untuk mewujudkannya yaitu dengan cara belajar dengan sungguh sungguh, mencari pengalaman pengalaman yang mungkin dapat berguna suatu saat nanti.',	'Iya, saya sewaktu SMA pernah mengikuti organisasi karya ilmiah remaja dan komunitas komputer. Dari sana saya memiliki pengalaman untuk menambah skill saya dalam bidang penulisan karya ilmiah maupun di bidang pengaplikasian komputer',	1,	1653559104,	NULL,	0),
('SCHLR-RNTZZ-d63334',	'USR-RNTZZ-f5b04',	'Renata Az Zahro',	'2004-05-25',	'89502357100',	'Jalan Patiunus Gang 29',	'Matematika IPA',	'SMAN 1 Pasuruan',	'3.5',	'6',	'Perkenalkan saya Renata. Selama bersekolah 3 tahun di SMAN 1 Pasuruan saya memiliki ketertarikan di bidang seni. Selama bersekolah saya berhasil memenangkan beberapa kompetisi desain grafis serta menjadi penampil tari di beberapa event, saya juga aktif dalam organisasi Karya Ilmiah Remaja, OSIS, MPK, Remaja Mushola, Paskibraka, Tari Tradisional serta klub seni dan desain. Hal tersebut saya lakukan dengan tetap fokus pada pelajaran sehingga dapat menjadi siswi kelas unggulan selama 3 tahun dan lulus dengan nilai sekolah 86,28',	'Saat ini fokus saya adalah lulus SBMPTN Universitas Brawijaya jurusan kedokteran dan ITS jurusan teknik lingkungan. Untuk mewujudkan hal tersebut, saya banyak mengikuti pelatihan-pelatihan persiapan SBMPTN dan try out gratis agar mendapat gambaran ketika UTBK',	'Ya saya punya pengalaman organisasi, saya memiliki pengalaman organisasi sebagai ketua di klub tari dan klub seni dan desain, saya juga menjabat sebagai sekertaris dalam organisasi MPK dan Panitia Kelulusan serta menjadi koordinator divisi dalam Karya Ilmiah Remaja dan menjadi anggota dalam Paskibraka, Remaja Mushola, OSIS. ',	1,	1655720716,	NULL,	0),
('SCHLR-RRCVR-e6b643',	'USR-RRCVR-18a01',	'RR. CIVIRO DIVA RAMADHANI',	'2005-10-21',	'89651160008',	'DK Karangan GG 4d, Rt 11 No 14, Surabaya, Jawa Timur',	'-',	'SMA Muhammadiyah 9 Surabaya',	'0.00',	'2',	'Nama saya RR. Civiro Diva Ramadhani. Saya adalah seorang pelajar di SMA Muhammadiyah 9 Surabaya, saya pelajar kelas 10 yang berada di kelas pengetahuan alam (MIPA). Saya memilki minat pelajaran bahasa asing seperti bahasa Inggris, saya juga mengikut ekstrakulikuler English Club di sekolah.',	'Saya bermimpi menjadi seorang dokter yang juga seorang dosen.\r\n\r\nCara saya mewujudkan mimpi saya adalah dengan konsisten dengan tujuan saya, fokus untuk belajar, berdo\'a dan juga mengembangkan skill dan juga potensi diri yang saya milikki.',	'Saya mengikuti Organisasi kepengurusan di luar sekolah (KIPS) dan menggambil peran di bidang keamanan, saya juga aktif dalam kegiatan Volunteer salah satu akun Instagram (teenztalk.id), saya bertugas sebagai Social Media Manager.\r\n\r\nSaya mempelajari banyak hal, termasuk cara untuk berinteraksi dan beradaptasi dengan sesuatu yang baru.',	1,	1653571091,	NULL,	0),
('SCHLR-RRKMB-8b6b12',	'USR-RRKMB-c122f',	'Aurora kimberlyn',	'2002-05-28',	'85156753554',	'Jl. Ambeng ambeng, Ngingas, Waru, Sidoarjo, Jawa Timur 61256',	'IPA',	'Madrasah aliyah negri kota sur',	'8.00',	'0',	'Nama saya Aurora kimberlyn, saya siswa lulusan tahun 2020. Selama 2 tahun ini saya tidak melanjutkan pendidikan karna masalah ekonomi. Dari dulu saya senang dengan berbagai hal, apalagi tentang belajar ilmu akademik. Saya cepat memahami sesuatu, tetapi karna faktor eksternal dari diri saya. 2 tahun ini saya menyadari kemampuan saya mulai tumpul karna fokus membantu ekonomi keluarga. Dan saya sadar, saya perlu belajar kembali. Dengan segala keterbatasan yang ada saya mencoba memanfaatkan berbagai peluang. Mengikuti seminar, mengikuti kelas kelas online gratis. Saya orang yang optimis ketika saya menginginkan sesuatu. Dari saya yang memang dari dulu suka belajar mengenai sesuatu yang baru dan kemampuan saya yang cepat menyerap. Saya yakin bisa berkembang. Dan saya ingin meningkatkan kemampuan saya dengan meneruskan pendidikan ke tingkat universitas. Tidak hanya terhenti di bangku sma. Karna menurut saya ilmu universitas sifatnya universal. Saya sadar ketika 2 tahun berhenti sekolah, bahwa menuntut ilmu harus terarah. Saya ter tarik dengan manajemen, dan mencoba untuk terus belajar dan mengembangkan lebih jauh lagi mengenai ketertarikan saya. Saya naif, tapi saya yakin saya mampu dan bisa.',	'Saya bermimpi menjadi revolusioner dalam bidang bisnis. Saya mewujudkan dengan cara mempelajari dan memahami bagaimana cara berbisnis. Saya mulai membuka usaha makanan tanpa modal. Dan konsisten dengan apa yang saya lakukan sekarang. Mulai melakukan riset terhadap umkm yang sukses dari media online. Terus belajar dan langsung mempraktekan apa yang saya pelajari.',	'Saya pernah bergabung di organisasi pecinta alam saat saya sma. Saya menjadi ketua umum organisasi pecinta alam yang berada di sekolah saya. Dari organisasi tersebut, saya belajar banyak hal. Mempelajari tentang komunikasi dan loyalitas yang harus dibangun didalam suatu organisasi. Mempelajari tentang manajemen waktu. Membangun sebuah relasi yang luas tidak di tingkat sma saja, bahkan juga bergabung dengan mahasiswa. Mengontrol organisasi baik internal maupun eksternal. Mempelajari berbagai sikap manusia. Juga belajar mengenai manajemen ketika mendirikan sebuah acara. Karna saya dipercayai sebagai ketua, saya memiliki tanggung jawab yang besar untuk mengontrol organisasi saya. Saya membuat program kerja yang sebelumnya tidak ada. Seperti tabur benih di salah satu sungai daerah saya. Juga menghidupkan kembali program kerja yang terhenti. Membuat taman untuk sekolah saya, juga menerapkan program zero waste disekolah saya. ',	1,	1653818364,	NULL,	0),
('SCHLR-RRPSP-20a8e2',	'USR-RRPSP-d4b99',	'Roro Puspitasari ',	'2002-11-17',	'89621729364',	'Jalan Kp. Gunung Payung No.44 RT 06 RW 03 Kelurahan Bambankerep, Kecamatan Ngaliyan, Kota Semarang ',	'Teknologi Hasil Perikanan ',	'Universitas Diponegoro ',	'3.67',	'1',	'saya merupakan anak ke-dua dari dua bersaudara dengan orang tua yang bekerja sebagai satpam dan penjual makanan di kantin salah satu dinas di Kota Semarang. orang tua saya selalu mengutamakan pendidikan dengan menuntut anak-anaknya bersekolah setinggi mungkin. hal tersebut memacu saya untuk bersemangat agar dapat membahagiakan orang tua saya dengan mendapatkan gelar dan ilmu yang dapat saya bagikan ke orang lain. saya mengambil prodi teknologi hasil perikanan di undip, prodi yang cukup kurang diminati oleh banyak orang dan dipandang sebelah mata. saya mengambil prodi tersebut karena menurut saya, Indonesia memiliki sumber daya alam di laut yang belum di olah dengan optimal, sehingga saya ingin dapat berkontribusi untuk negara dengan mengambil prodi tersebut dan nanti setelah lulus saya dapat menerapkan ilmu yang telah saya pelajari. kelebihan saya yaitu mudah beradaptasi, tidak mudah menyerah dan bertanggung jawab. kelemahan saya yaitu mengerjakan segala sesuatu dengan dua kali kerja, hal tersebut saya lakukan karena saya ingin meminimalisir kesalahan yang dapat saya buat, namun saya dapat mengatasi kelemahan saya dengan fokus apa yang saya kerjakan sehingga dapat mengerjakan segala sesuatu dengan sekali kerja saja.',	'mimpi terbesar saya yaitu dapat berkontribusi kepada negara dengan mengoptimalkan sumber daya laut yang diolah dengan sebaik mungkin dan dapat diekspor ke luar negeri sehingga negara dapat pemasukan dari aktivitas tersebut, cara saya mewujudkannya yaitu saya mengambil prodi teknologi hasil perikanan dan mempelajari dengan baik ilmu yang diberikan oleh para dosen.',	'pengalaman organisasi saya baru satu yaitu mengikuti himpunan mahasiswa di prodi saya semester ini, saya berada di divisi sosial masyarakat dan telah menjalankan beberapa program kerja salah satunya mengadakan kegiatan donasi dan buka bersama di panti asuhan. program kerja yang akan dikerjakan di beberapa bulan mendatang ada sosialisasi mengenai produk perikanan di sekolah dasar. akhir-akhir ini saya mendaftar dan keterima menjadi salah satu bagian anggota gerakan mengajar desa, salah satu organisasi di luar kampus yang bergerak di bidang pendidikan. akhir tahun ini saya akan mengabdi di desa binaan kota saya selama 7 hari untuk mengajar anak-anak yang berada di desa.',	1,	1655381483,	NULL,	0),
('SCHLR-RSHKN-c9329f',	'USR-RSHKN-6a2b4',	'Rashiekannafi Naufal Hilmy',	'2001-08-23',	'895416005917',	'Perum. Permata Majapahit Kav-3, Jl. Plamongan Sari Raya, RT.05/RW.12, Plamongan Sari, Pedurungan, Semarang',	'Arsitektur',	'Universitas Diponegoro',	'4.00',	'2',	'Saya adalah seorang introvert. Saya menyukai hal baru, dan saya baik dalam memanajemen waktu dan orang lain. Saya memiliki kemampuan untuk memahami orang orang lain, tetapi tidak mampu bersosialisasi dengan baik. Saya lebih menyukai belajar dalam sepi daripada berkerumun dan berdiskusi. Akan tetapi saat ini saya ingin menjadi orang yang berbeda. Saya ingin memiliki skill public speaking yang baik, sosial yang baik, komunikasi yang baik, sehingga dapat menunjang kehidupan saya kedepannya. Karena saya sadar bahwa saya tidak bisa selalu menjadi orang yang tertutup seperti itu. ',	'Mimpi terbesar saya adalah menjadi orang yang berguna bagi banyak orang. Saya ingin menjadi orang yang berkecukupan agar bisa membantu banyak orang. Saya ingin mencapai hal itu melalui cita-cita saya sejak kecil, yaitu ingin menjadi arsitek. Arsitek yang mampu memfasilitasi kebutuhan masyarakat dan lingkungan. Arsitek yang dapat membuat bangunan yang indah dan dikenal banyak orang. ',	'Tidak ada.',	1,	1654490698,	NULL,	0),
('SCHLR-RSKND-b5bb7f',	'USR-RSKND-06e6e',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654919532,	NULL,	0),
('SCHLR-RSKYT-777221',	'USR-RSKYT-aa64c',	'Risky Trisnawati Putri',	'2003-03-13',	'85727703973',	'Dawu, Paron-Ngawi',	'Sastra Inggris/FS',	'Universitas Negeri Malang',	'3.61',	'2',	'Saya adalah mahasiswi semester 2 yang akan naik ke semester 3 bulan Agustus nanti. Saya berkuliah disalah satu universitas negeri di Malang. Saya adalah orang yang suka kegiatan, yang mana bisa mengasah kemampuan leadership seperti saat saya di SMA, saya mengikuti beberapa organisasi osis, pramuka dan menjadi ketua organisasi pencak silat. Melalui ini saya belajar tentang bagaimana memanfaatkan waktu dengan baik. Karena selain berorganisasi saya juga harus belajar serta melakukan kegiatan lain. Dari sini saya belajar banyak hal dan menjadi orang yang disiplin serta gemblengan yang membuat saya menjadi orang yang pekerja keras. Saya juga mengikuti kegiatan AIESEC Local Project yang akan dilaksanakan akhir bulan ini. Kegiatan ini fokus mengajar anak-anak tentang literasi. Saya berharap dapat mendapatkan pengalaman dan pengetahuan yang membuat saya terus berkembang dan siap menjadi pemimpin dimasa depan.',	'Mimpi terbesar saya adalah menjadi bagian dari kesuksesan Indonesia. Ikut serta dalam memajukan pendidikan Indonesia. Maka dari ini saya belajar dan beraksi melalui program SDGs terutama nomer 4. Saya juga ingin mewujudkan dan mendorong gerakan 2045 Indonesia menuju golden generation. Karena background saya juga dipersiapkan untuk menjadi pengajar yang berkualitas dimasa depan nanti. Maka dari itu saya harus mencari banyak pengalaman dan pengetahuan saat ini, sebelum saya nantinya yang akan memberikan pengalaman dan pengetahuan kepada generasi berikutnya. Dengan memanfaatkan pelatihan soft skill maupun hard skill yang sekarang banyak ditemui di sosial media. Saya berharap dapat mendapatkan banyak pengalaman yang sangat berharga.',	'Ya, saat saya masih disekolah dasar, guru saya selalu mengajarkan untuk berbagi. Hal ini dapat direalisasikan saat kegiatan pramuka. Tim saya mendapatkan tugas untuk membagikan beras kepada orang kurang mampu yang telah disurvei oleh guru sebelumnya. Saat di SMP saya mengalami hal yang sama. Saat kegiatan pondok romadhon selama 3 hari, dihari terakhir semua murid berjalan menuju pasar untuk membelikan makanan yang layak untuk diberikan kepada tukang becak, sebelumnya setiap tim diberikan uang 20 rb. Karena hal inilah saya merasa bahwa berbagi adalah hal yang indah. Saya sangat berterimakasih kepada para guru yang telah menanamkan hal baik itu dihati saya. Saat SMA saya mulai mengikuti beberapa kegiatan untuk mengupgrade saya menjadi manusia yang lebih berguna lagi. Dan terakhir saya akan melaksanakan kegiatan AIESEC Local Project yang fokus kepada pendidikan anak-anak.',	1,	1655733639,	NULL,	0),
('SCHLR-RSLNJ-2f7fdc',	'USR-RSLNJ-3e8bb',	'Ruslan Jayadi',	'1997-09-27',	'82340132636',	'Lengkok Dalam Desa Selong Belanak Kec Praya Barat Kab Lombok Tengah NTB',	'Ekonomi Islam',	'Universitas Nahdlatul Ulama Nu',	'3.58',	'6',	'Perkenalkan nama saya Ruslan jayadi, saya lahir di Lombok , 27 September 1997 \r\n.Saya mahasiswa  prodi S1 Ekonimi islam di Universitas Nahdlatul Ulama NTB dan  saat ini saya aktif di organisasi Himpunan \r\nMahasiswa Ekonomi islam dan diluar kampus saya juga aktif di organisai BAPERA( Barisan \r\nPemuda Nusantara) dan Poqdarwis Desa Selong Belanak Saya juga pernah magang di PT \r\nMItra Alam Semviak Villas selama 2 tahun dan Saya berasal dari keluarga yang bahkan jauh \r\ndari kata sederhana. Ayah saya hanya bekerja serabutan, serta ibu saya bekerja sebagai \r\npeneneun kain sensek . Saya merupakan anak pertama dari 3 bersaudara, adik kedua saat ini \r\nmasih smp dan yang terakhir masih balita Sebagai anak tertua, saya tidak ingin membebani \r\nkedua orang tua saya. Saya ingin berkuliah karena ingin mengangkat derajat orang tua, bisa \r\nmendapatkan kehidupan yang lebih baik, dan yang pasti bisa mendapatkan pengetahuan dan \r\nilmu lebih dari apa yang saya dapatkan sekarang. Saya memiliki cita-cita untuk menjadi \r\nseorang konsultan Bisnis Syariah , maka dari itu saya ingin memilih jurusan S1 Ekonomi Islam , \r\nkelebihan saya menyukai hal hal yang baru dan menyukai tantangan mudah bergaul dengan \r\nsiapapun kekuranagn saya ceapat bersedih dan mudah mempercayai orang yang belaum saya \r\nkenal \r\nMotivasi saya mengikuti Beasiswa pemuda youth break the boundaris tentunya menambaah banyak relasi dan bisa saling \r\nbertukar pikiran .Setelah dua tahun menempuh ilmu ekonomi syariah di UNU NTB saya \r\nkemudian mencoba bergabung di sejumlah organisasi intra maupun ekstra kampus. Tujuan dari \r\nlangkah ini adalah membantu saya untuk mengembangkan diri. Sebab dari organisasi ini saya \r\nbisa mengasah berbagai keterampilan yang belum tentu saya dapatkan di perkuliahan. \r\nKeaktifan saya di sejumlah organisasi membantu saya tidak hanya menjadi mahasiswa dengan \r\ndua kesibukan, yakni kuliah lalu pulang. Hanya saja keaktifan ini juga menuntut biaya lebih. \r\nYakni untuk memenuhi kebutuhan selama mengikuti kegiatan organisasi dan juga kegiatan \r\npembelajaran Kebutuhan dana juga saya rasakan untuk bisa memenuhi kebutuhan buku-buku \r\nkuliah dan referensi lainnya.\r\n',	'Mimpi terbesar saya adalah mempunyai sebuah lembaga pelatihan kerja yg dimana lembaga ini akan membantu anak-anak muda yang ada di NTB sehingga anak muda bisa  bersaing di dunia kerja , cara untuk mengukuhkan mimpi sya ini dgn membangun relasi mulai dari sekarang karena tanmpa relaasi kita tidak akan bisa tercapai apa yang kita inginkan',	'1.BAPERA Barisan Pemuda Nusantara,\r\n2. Poqdarwis Selong Belanak\r\n3. Karang Taruna Desa Selong Belanak\r\n4. Himpunan Mahasiswa Ekonomi Islam Universitas Nahdlatul Ulama\r\n5. Jajaran Peraje Sasak Lombok\r\n',	1,	1653640717,	NULL,	0),
('SCHLR-RSLNJ-7acd64',	'USR-RSLNJ-3e8bb',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1653640850,	NULL,	0),
('SCHLR-RSMT-1c6994',	'USR-RSMT-52c0f3',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1653809230,	NULL,	0),
('SCHLR-RSRNT-0805b7',	'USR-RSRNT-c7ef7',	'Arisa Ranteallo',	'2005-08-04',	'89608825148',	'Tondon Mamullu, Makale, Tana Toraja, Sulawesi Selatan, Indonesia',	'IPA',	'SMAN 1 TANA TORAJA',	'0.00',	'4',	'Hai, perkenalkan nama saya Arisa Mintin Ranteallo bisa dipanggil Arisa. Saya berjenis kelamin laki-laki, mungkin terdengar agak lucu karena nama saya yang lebih condong ke nama perempuan apalagi nama perempuan di Jepang. Tapi ada alasan tersendiri orang tua saya memberi nama itu. Saya orangnya humoris tapi kadang pendiam, saya berasal dari keluarga menengah ke bawah yang kini tinggal Ibu yang menjadi kepala keluarga dan 4 bersaudara yang sebelumnya 5 tapi ada suatu insiden yang membuat kakak saya harus pergi. Kehidupan saya sehari-hari, yaitu membantu Ibu dalam mengerjakan pekerjaan rumah dan bisa dibilang menggantikan posisi Ibu yang menjaga adik saya yang masih TK. Mungkin agak sepele tapi saya menganggap ini adalah jalan bagi saya meskipun Ayah dan kakak saya telah pergi meninggalkan kami. Tapi saya dan keluarga saya tetap memegang teguh jika ini adalah cobaan bukanlah jalan buntu yang membuat kami putus asa dan saat ini saya secara tidak langsung telah dituntun untuk bisa berpikir secara kritis agar bisa membuat hari dapat berjalan dengan baik. Kehidupan saya disekolah cukuplah baik, meskipun dalam segi akademik agak kurang tapi saya tetap ingin bersekolah dan terus belajar karena saya menyadari bahwa tanpa ilmu itu bagaikan sebuah air yang keruh. Semenjak kakak saya pergi, saya perlahan-lahan mempelajari Stoikisme dan mempelajari filosofi hidup bagaikan air yang menurut saya ini adalah cara terbaik untuk tetap optimis menjalani hidup meskipun banyak halangan tetapi, saya tetap akan mengikuti arus sampai dimana arus itu berhenti. Sekian dari saya, saya mohon maaf jika saya terlalu lebar dalam menjelaskan mengenai diri saya. Terimakasih',	'Mimpi saya adalah ingin membagikan kasih sayang kepada orang yang belum pernah merasakan arti kasih itu. Mungkin terdengar agak aneh diumur saya saat ini tapi itulah impian ku sekarang ini. Dan menurut ku cara untuk mewujudkannya adalah belajar, karena belajar adalah jalan satu-satunya saya untuk bisa mewujudkan impian itu. Belajar menurut saya tidak harus dari pelajaran dari sekolah, melainkan pelajaran dari kehidupan yang telah dialami. ',	'Saya pernah masuk di organisasi pencak silat dan sekarang ini menjadi pengurus OSIS di sekolah. Pengalaman saya selama masuk dalam organisasi adalah sistem didalam organisasi, saat saya ikut organisasi Gereja saya sering menemui anggota yang selalu memberikan kekerasan terhadap anggota yang baru dan menganggap itu adalah hal yang lumrah dan kadang anggota yang baru biasa diberikan sanksi yang agak berlebihan. Inilah yang menurut saya telah melenceng dari sebuah tujuan dari organisasi, organisasi adalah wadah untuk bisa membentuk karakter seseorang bukanlah tempat untuk merusak mental seseorang. Tapi seiring dengan waktu saat saya mengikuti organisasi OSIS di SMA, saya beruntung bisa masuk dengan anggota-anggota yang tidak menerapkan sistem yang merusak mental seseorang. Dan justru membuka peluang untuk meningkatkan diri dalam organisasi ',	1,	1653582483,	NULL,	0),
