('SCHLR-RSRNT-ceb9a6',	'USR-RSRNT-c7ef7',	'Arisa Mintin Ranteallo',	'2005-08-04',	'89608825148',	'Tondon Mamullu, Makale, Tana Toraja, Sulawesi Selatan, Indonesia',	'IPA',	'SMAN 1 TANA TORAJA',	'0.00',	'4',	'Hai, perkenalkan nama saya Arisa Mintin Ranteallo bisa dipanggil Arisa. Saya berjenis kelamin laki-laki, mungkin terdengar agak lucu karena nama saya yang lebih condong ke nama perempuan apalagi nama perempuan di Jepang. Tapi ada alasan tersendiri orang tua saya memberi nama itu. Saya orangnya humoris tapi kadang pendiam, saya berasal dari keluarga menengah ke bawah yang kini tinggal Ibu yang menjadi kepala keluarga dan 4 bersaudara yang sebelumnya 5 tapi ada suatu insiden yang membuat kakak saya harus pergi. Kehidupan saya sehari-hari, yaitu membantu Ibu dalam mengerjakan pekerjaan rumah dan bisa dibilang menggantikan posisi Ibu yang menjaga adik saya yang masih TK. Mungkin agak sepele tapi saya menganggap ini adalah jalan bagi saya meskipun Ayah dan kakak saya telah pergi meninggalkan kami. Tapi saya dan keluarga saya tetap memegang teguh jika ini adalah cobaan bukanlah jalan buntu yang membuat kami putus asa dan saat ini saya secara tidak langsung telah dituntun untuk bisa berpikir secara kritis agar bisa membuat hari dapat berjalan dengan baik. Kehidupan saya disekolah cukuplah baik, meskipun dalam segi akademik agak kurang tapi saya tetap ingin bersekolah dan terus belajar karena saya menyadari bahwa tanpa ilmu itu bagaikan sebuah air yang keruh. Semenjak kakak saya pergi, saya perlahan-lahan mempelajari Stoikisme dan mempelajari filosofi hidup bagaikan air yang menurut saya ini adalah cara terbaik untuk tetap optimis menjalani hidup meskipun banyak halangan tetapi, saya tetap akan mengikuti arus sampai dimana arus itu berhenti. Sekian dari saya, saya mohon maaf jika saya terlalu lebar dalam menjelaskan mengenai diri saya. Terimakasih',	'Mimpi saya adalah ingin membagikan kasih sayang kepada orang yang belum pernah merasakan arti kasih itu. Mungkin terdengar agak aneh diumur saya saat ini tapi itulah impian ku sekarang ini. Dan menurut ku cara untuk mewujudkannya adalah belajar, karena belajar adalah jalan satu-satunya saya untuk bisa mewujudkan impian itu. Belajar menurut saya tidak harus dari pelajaran dari sekolah, melainkan pelajaran dari kehidupan yang telah dialami. ',	'Saya pernah masuk di organisasi pencak silat dan sekarang ini menjadi pengurus OSIS di sekolah. Pengalaman saya selama masuk dalam organisasi adalah sistem didalam organisasi, saat saya ikut organisasi Gereja saya sering menemui anggota yang selalu memberikan kekerasan terhadap anggota yang baru dan menganggap itu adalah hal yang lumrah dan kadang anggota yang baru biasa diberikan sanksi yang agak berlebihan. Inilah yang menurut saya telah melenceng dari sebuah tujuan dari organisasi, organisasi adalah wadah untuk bisa membentuk karakter seseorang bukanlah tempat untuk merusak mental seseorang. Tapi seiring dengan waktu saat saya mengikuti organisasi OSIS di SMA, saya beruntung bisa masuk dengan anggota-anggota yang tidak menerapkan sistem yang merusak mental seseorang. Dan justru membuka peluang untuk meningkatkan diri dalam organisasi ',	1,	1653702876,	NULL,	0),
('SCHLR-RSTVS-89038e',	'USR-RSTVS-613e9',	'Ria Istavia Sa’bi ',	'2004-06-09',	'85251181574',	'Indralaya ',	'Teknik pertambangan',	'Universitas Sriwijaya ',	'3.03',	'1',	'Nama saya Ria Istavia Sa’bi, umur saya 17 tahun. Saya berasal dari pedalaman yaitu Seko,Sulawesi Selatan. Saya merupakan anak Desa yang bercita-cita tinggi hingga merantau ke pulau sumatra untuk menimbah Ilmu. Saya memilih teknik pertambangan karena desa saya kaya akan SDA terutama hasil buminya oleh karena itu jika buka putri daerah siapa yang akan mengolahnya dengan baik dan menjadikan desa kecil itu maju? Tidak mungkin untuk investor asing lagi. Oleh karena itu walaupun berasal dari desa kecil namun tidak menggoyahkan semangat saya untuk berjuang dan terus belajar. Saya juga berharap penuh dari beasiswa ini dalam membantu saya berkonstrubusi di dalam negri.',	'Menjadikan Indonesia lebih maju dimulai dari desa saya agar setara dengan kota-kota kecil lainnya agar terus makmur dengan semangat juang seorang pelajar.',	'Saya ikut dalam organisasi OSIS saat saya SMA. Saya menjadi koordinator bidang,bekerja dengan 4 orang.Di mana saya berkostribusi dalam setiap diskusi dan pengambilan keputusan. Dengan kerjasama tim dan komunikasi yang baik saya berhasil menjalankan program kerja saya dengan baik.',	1,	1654087718,	NULL,	0),
('SCHLR-RSTYD-4ccef9',	'USR-RSTYD-9f701',	'Restya Dwi Atiiqah',	'2003-08-25',	'85790752284',	'Jalan Raya Dermo no.48, RT.01, RW.02, Mulyoagung, Kec. Dau, Kab. Malang, Jawa Timur',	'Bioteknologi',	'Universitas Negeri Malang',	'3.65',	'2',	'Saya Restya Dwi Atiiqah, biasa dipanggil tya. Saya mahasiswa bioteknologi semester 2 di Universitas Negeri Malang. Saya merupakan seorang yang sangat tertarik dalam mempelajari hal yang baru. Selama perkuliahan ini, saya banyak mendapatkan hal yang baru sehingga saya tertarik untuk mencari tau lebih jauh hal tersebut dari berbagai sumber. Setelah pembelajaran selesai, saya selalu belajar kembali apa yang sudah di jelaskan oleh dosen sehingga menjadi lebih paham. Mengerjakan tugas jauh sebelum deadline sangat membantu saya dalam mendapat waktu luang yang banyak.  ',	'Mimpi terbesar saya yaitu menjadi seorang peneliti. Berkuliah di jurusan bioteknologi merupakan salah satu cara saya dalam mewujudakan mimpi tersebut. Selama 2 semester ini, saya belajar dengan giat agar dapat memahami mata kuliah yang diberikan. Namun, tidak hanya belajar saja tetapi diiringi dengan ibadah dan doa agar segalanya jauh lebih mudah. Selain itu, dengan mendaftar beasiswa YBB agar mendapatkan peluang untuk mengupgrade skill yang dapat membantu saya dalam mewujudkan mimpi saya.',	'Dalam beroorganisasi saya pernah menjadi sie dekorasi yang membantu memberikan ide dekorasi dan ikut serta dalam mendekorasi. Selain itu, Saat ini saya sedang mengikuti sebuah organisasi kampus dan saya menjadi sie acara dalam salah satu prokernya yang bertugas untuk membagi kelompok penyuluhan dan survei lokasi/target.',	1,	1654500961,	NULL,	0),
('SCHLR-RTHNG-e29e86',	'USR-RTHNG-38bbd',	'ruth angieta',	'2003-01-24',	'8119152401',	'Jl. Cililitan Besar No. 47',	'Teknik Industri',	'UPNVJ',	'3.93',	'2',	'Hai, perkenalkan nama saya Ruth Angieta. U guys can call me ruth. Umur aku 19 tahun, aku punya 2 kakak, actually 1-nya kembar. Kalo orang tanya tentang aku, mungkin bisa dibilang aku orang yang ramah, sopan, loyal, easy-going. But to be honest i\'m an introvert person. Aku gabisa cepet berbaur sama orang ditengah keramaian apalagi stranger. Tapi poin yang selalu aku tanamkan adalah bagaimana caranya orang bisa nyaman deket aku dan enggak ngerasa canggung even baru kenal. Kegiatan sehari-hari yang aku lakuin kalo engga belajar, tidur, olahraga, dan bantu-bantu mami kaya masak dll. Pandemi kaya gini bikin aku bosen sometimes, jadi yang selalu aku lakuin kalo bosen biasanya baca novel or alternative universe (au), or wattpad. One thing yang aku suka dari baca novel n others karena aku bisa buat apa yang ada di cerita itu jadi karakter atau peran i\'ve imagine. Kalo di film kaya flat ajaa gitu karena the character n the sets udah di built disitu. i think that\'s why i\'m easily bored watch film n others. Oh iya selain baca novel dll belakangan ini aku  lagi nyari-nyari tentang internship n scholarship. Aku ngerasa pandemi ini menghambat aku buat untuk berkembang dan aku berfikir sekarang gimana caranya untuk upgrade diri aku buat ga stuck di flat zone. Aku berharap bisa lebih aktif kedepannya, pandemi bukan lagi hal yang menghambat aku nantinya. Aku rasa ini yang bisa aku ceritain tentang aku. Semoga banyak hal bermanfaat yang bisa aku lakuin di program ini.',	'Dulu aku mau banget jadi dokter, especially dokter kejiwaan. Aku mau ngebantu orang-orang  yang sakit,mau bikin mereka sembuh dan bisa ngeliat dunia ini gasejahat yang mereka rasain, mau bikin mereka tau kalo masih banyak yang sayang sama mereka. Tapi ternyata Tuhan punya rencana yang jauh lebih hebat dari yang aku pikir. Aku udah coba berbagai cara tapi tetep gamasuk FK. Tapi disaat down kaya gitu aku berdoa, di jurusan apapun kalo emang aku bisa berkembang disitu i\'ll try my best n here I am, di jurusan Teknik Industri. Sekarang kalo ditanya apa mimpi terbesar aku, i\'ll answer the same answer. Cuma bedanya dulu mau menolong orang yang sakit as a doctor, sekarang aku tetep mau nolong orang yang sakit dan sedih dengan buat suatu tempat rehabilitasi. Aku mau banget bikin mereka bangkit kalo di dunia ini masih banyak hal yang bisa mereka lakuin, masih banyak tujuan, masih ada tempat untuk berjuang, masih ada orang peduli. Cara aku untuk wujudin mimpi besar itu yang pasti ya sekarang, dengan belajar giat, aku pengen banget bisa jadi orang sukses dan punya dana untuk bangun mimpi terbesar aku. Aku masih belum tau apa itu akan terwujud tapi aku akan coba untuk bisa wujudin itu, pasti. Untuk impian terbesar aku lainnya yang pasti adalah bisa dapet scholarship ke luar negeri dan membahagiakan orangtua aku. Aku pengen tunjukkin ke mereka kalo usaha mereka selama ini untuk menyekolahkan aku bukan hal yang sia-sia. One day aku berharap semua ini bisa terwujud.',	'Dulu aku ikut organisasi  pmr dan cheerleader saat smp, dan organisasi paskibra saat sma. Untuk kampus, sejauh ini aku belum ikut organisasi tapi aku punya pengalaman event yang diadain dari kampus. Tapi yang paling berkesan itu saat event pengabdian masyrakat. Event ini diadain dengan mengunjungi suatu panti asuhan dan peran kita mengajar anak-anak disana dan berbagi. Selama pra-event itu aku seneng banget aku bisa ngebantu temen-temen aku, kebetulan aku dapet divisi konsumsi. Jadi aku ngebantu cari-cari konsumsi yang berkualitas tapi harganya juga pas. Disitu aku sadar ternyata jadi panitia event itu enggak mudah. Untuk organisasi dan event kampus dan luar kampus  aku lagi daftar dan coba-coba cari tau semogaa bisa keterima.',	1,	1655277923,	NULL,	0),
('SCHLR-RVLDJ-f3d78d',	'USR-RVLDJ-bdde3',	'rivaldo jonathan',	'2006-01-31',	'85745071723',	'Jl. Wiguna selatan XV no 6',	'belum kuliah',	'SMAK ST HENDRIKUS SURABAYA',	'3.00',	'2',	'perkenalkan nama saya rivaldo jonathan bisa dipanggil jojo seorang anak sma biasa yang bersekolah di SMAK ST HENDRIKUS SURABAYA saya dibesarkan oleh oma saya dan tante saya karena kedua orangtua saya cerai. Meskipun dibesarkan tanpa kedua orangtua saya tidak manja dan tidak terlalu larut dalam kesedihan karena saya juga mempunyai masa depan yang cerah dan tanpa kedua orang tua saya juga bisa sukses di kemudian hari. ',	'mimpi terbesar saya bisa membahagikan oma dan tante saya yang telah membesarkan saya sejak kecil karena mereka sudah banyak berkorban dalam membesarkan saya sampai saat ini. Dan juga ingin mewujudkan kepada kedua orangtua saya bahwa saya merupakan anak yang berhasil di kemudian hari.',	'punya, pengalaman organisasi saya dalam bidang pelayanan di gereja. Dimana saya membantu menjadi multimedia di tim sekolah minggu. Banyak sekali cerita dalam menjadi multimedia dari yang senang dan bangga sampai membuat pusing di kepala karena banyak sekali revisi yang diminta. Namun, terlepas dari revisi tersebut saya mengingat kembali tujuan dan motivasi saya dalam menjadi pelayanan di gereja yaitu mengembalikan kembali talenta yang saya miliki kepada Tuhan.',	1,	1654090361,	NULL,	0),
('SCHLR-RVLFZ-64e7ed',	'USR-RVLFZ-06ea2',	'Rival Fauzi Rahman',	'2001-07-27',	'895803569600',	'Kp. Pasekon RT 01/ RW 12 Desa Cipendawa Kecamatan Pacet Kabupaten Cianjur Jawa Barat ',	'Teknik Elektro',	'UIN Sunan Gunung Djati',	'3.64',	'4',	'Menurut saya, saya memiliki pribadi yang baik bisa diajak kerja sama mengenai hal apapun, mudah beradaptasi dengan lingkungan yang baru, dan menyukai hal hal yang sifatnya menantang diri sendiri',	'Mimpi saya adalah menciptakan suatu alat yang memudahkan manusia untuk melakukan sesuatu dan cara saya mewujudkan mimpi tersebut adalah dengan belajar serta menambah relasi dengan orang-orang',	'Yaa, Organisasi yang sedang saya jalankan sekarang adalah Robotika yakni organisasi tentang pemahaman dan pembelajaran tentang robot ataupun teknologi yang sedang ramai diperbincangkan',	1,	1653816894,	NULL,	0),
('SCHLR-RVPTR-366a6a',	'USR-RVPTR-2b7ec',	'Irvi Putri Fardian',	'2003-03-21',	'85759931930',	'Tasikmalaya, Jawa Barat.',	'Teknik Informatika',	'Universitas Perjuangan',	'3.85',	'2',	'Saya Irvi Putri Fardian, saat ini sedang menempuh studi Teknik Informatika di Universitas Perjuangan, Tasikmalaya. Sebagai mahasiswa sarjana tahun pertama, saya menyadari pentingnya menyeimbangkan kedua akademik yaitu keterampilan akademik dan keterampilan non akademik. Saya selalu berusaha untuk berprestasi baik dalam studi akademik dan non akademik. Dalam bidang akademik, saya dibuktikan pada masa saya menempuh Sekolah Menengah Atas saya mendapatkan berbagai perhargaan, diantaranya mengikuti Penelitian Science yang diselenggarakan oleh Indonesia Fun Science Award tingkat Nasional di Jakarta. Kemudian saya masuk dalam 3 besar ranking nilai terbesar dalam satu sekolah, dan saya menjuarai Olimpiade Fisika tingkat kabupaten. Dalam bidang non akademik, saya membuktikan diri saya dengan menjuarai berbagai bidang lomba, diantaranya Juara 1 Tari Kreasi tingkat kabupaten. Kemudian, menjuarai Lomba Dongeng Bahasa Sunda tingkat kabupaten, dan masih banyak lagi pengalaman yang telah saya coba. Selain itu, saya juga aktif dalam berkontribusi diberbagai program volunteer. Selanjutnya saya berpengalaman menjadi Brand Ambassador sekaligus Online Creator diberbagai program, seperti Indonesia Millennial Connect of Medan dan Cafe Nini Highschool League di Tasikmalaya.',	'Mimpi terbesar saya adalah menjadi seseorang yang bisa bermanfaat bagi orang lain. Menurut saya, kebahagiaan orang lain atau senyuman yang dilontarkan oleh orang lain merupakan bentuk rasa syukur dan rasa bahagia bagi saya. Untuk membantu mewujudkan mimpi atau tujuan terbesar saya adalah dengan selalu peduli, saling membantu dan tidak membeda-bedakan. Dengan program beasiswa yang diberikan oleh YBB merupakan bentuk usaha saya untuk bisa mewujudkan mimpi terbesar saya. Dengan kesempatan yang YBB berikan membuat saya semangat untuk tetap bisa berbagi ilmu dan tidak menyia-nyiakan hal dan kesempatan yang saya miliki. Saya yakin, saya bisa menjadi seseorang yang bermanfaat bagi orang disekitar saya.',	'Salah satu cara agar meningkatkan softskill dan hardskill saya yaitu dengan bergabung/berkontribusi dalam berbagai program, seperti melatih public speaking, menjalin relasi, dan mencoba hal yang baru adalah bentuk dari kepercayaan diri saya. Saya memiliki kepercayaan diri yang kuat, maka dari itu menjadi content creator adalah salah satu pilihan saya. Saya pernah menjadi Brand Ambassador terbaik di berbagai program, seperti EDUVEX, Educator.id, Indonesia Millennial Connect, Internasional Model United Nation, dan Indonesia Event. Selain itu, saya aktif dalam mengikut berbagai webinar dan juga volunteer. Saya menjadi Manusia Relawan Indonesia di program Aksi Cepat Tanggap di Tasikmalaya. Saya juga menjadi volunteer  divisi Sosial Media di program LiMateri. Selain itu menjadi seorang Public Relation juga pernah saya alami di program Sumbu Suara. Dengan mencoba banyak hal baru menambah semangat saya untuk bisa lebih berkontribusi dan bermanfaat bagi orang sekitar. ',	1,	1654392929,	NULL,	0),
('SCHLR-RYDVF-d5a888',	'USR-RYDVF-3c33a',	'Arya Diva Fabillah Rahim',	'2004-02-27',	'81329446796',	'Komplek Taman Pesona Bangka Blok X No. 5, Sungailiat',	'Matematika',	'Universitas Jenderal Soedirman',	'3.73',	'2',	'Perkenalankan nama saya Arya Diva Fabillah Rahim biasa dipanggil Arya dari jurusan matematika angkatan 2021 di Universitas Jenderal Soedirman sekaligus sebagai Ketua Angkatan matematika 2021. Saya berasal dari provinsi Kep. Bangka Belitung dan sedang berdomisili di Purwokerto. Saya termasuk mahasiswa berambisi tinggi, berpendirian teguh dan optimis serta pantang menyerah menghadapi segala rintangan. Saya termasuk mahasiswa yang gemar berorganisasi dan bersosialisasi karena saya ingin terus belajar untuk mengasah kemampuan dan potensial diri saya sekaligus meningkatkan softskill saya. Saya selalu menetapkan goals/target untuk mengukur kemampuan diri dan berlatih disiplin untuk menghargai waktu dan mengejar mimpi saya. Saya berasal dari keluarga yang selalu mensupport keinginan dan cita-cita saya serta membangun kepribadian saya untuk menjadi calon pemimpin masa depan.',	'Saya ingin menjadi sosok yang dapat membawa kepada suatu perubahan atau lebih tepatnya pemimpin yang memimpin dan mengajak kepada setiap orang untuk melakukan perubahan lebih dalam rangka menuju ke tujuan/mimpi/impian yang tinggi.\r\nMaka dari itu, Saya selalu mengajarkan kepada diri saya pentingnya menghargai sesama, berpendirian teguh, bekerja sama dalam tim, dan menghargai waktu. Saya mengikuti berbagai organisasi untuk belajar beradaptasi dan menempatkan diri saya sekaligus belajar mengenai berbagai jenis lingkungan berorganisasi sehingga mengajarkan saya untuk berhati-hati dalam segala kondisi, mendengarkan dan menghargai pendapat orang lain.\r\nSemua itu dilakukan dengan harapan dapat meningkatkan softskill sekaligus hardskill yang diperlukan untuk menjadi seorang pemimpin yang dihargai dan dapat menanggung kepercayaan yang diberikan.',	'- Koordinator Divisi Humas Sidang Umum KM MIPA 2021 (Selesai)\r\nSidang umum KM MIPA adalah suatu kegiatan musyawarah untuk membahas perkara putusan dan peraturan yang ada di Fakultas MIPA serta membahas permasalahan yang ada di FMIPA.\r\nSebagai Koordinator Divisi Humas, saya berhasil memberikan koordinasi yang baik kepada staff humas dan hubungan dengan koordinator divisi lain guna melancarkan kegiatan. Divisi humas sukses pula memberikan koordinasi yang baik dengan forum/delegasi Sidang Umum dan penyebaran informasi yang masif dan terstruktur sehingga forum/delegasi dapat mengikuti event dengan lancar dengan kehadiran forum/delegasi 100%.\r\n\r\n- Internship Kementerian Luar Negeri BEM KM MIPA 2021(Selesai)\r\nadalah program magang yang diadakan oleh Badan Eksekutif Mahasiswa KM MIPA dengan memberikan pengalaman 3 bulan menjadi staff dari kementerian yang ada di BEM KM MIPA sekaligus menarik minat dari mahasiswa untuk berani berorganisasi di BEM KM MIPA.\r\nSaya pernah dipercayakan sebagai Staff Humas kegiatan Webinar Dies Natalis FMIPA UNSOED ke-7 sekaligus sebagai Co-Host dalam acara tersebut. Saya memiliki jobdesk memberikan koordinasi dengan pemateri dan peserta webinar sekaligus memberikan info-info yang diperlukan terkait Webinar dan ikut berperan memastikan terlaksananya webinar dengan lancar.\r\nSaya juga pernah diberikan mandat untuk menjadi Project Officer dalam acara Webinar Building Career #2 bersama PT. Paragon. Saya memiliki tugas untuk mengatur dan mengkoordinasikan acara dengan lancar serta mengatasi kendala yang ada selama mempersiapkan webinar sekaligus belajar untuk berhubungan dengan Instansi/perusahaan besar. Alhasil acara berlangsung sukses dan informatif antara partisipan dan pemateri tanpa adanya kendala yang berarti.\r\nSelain itu, saya juga pernah dipilih untuk menjadi Sekretaris dalam kegiatan Webinar Quarter Life Crisis. Saya belajar dalam mengurusi segala sesuatu yang berhubungan dengan persuratan berjumlah sekitar 10 lebih dan membantu mengatasi skill saya khususnya dalam penggunaan Microsoft Office Word.\r\n\r\n- Staff Divisi Literasi BEM KM MIPA 2021\r\nDivisi Literasi BEM KM MIPA adalah Divisi yang ada di Badan Eksekutif Mahasiswa KM MIPA yang bergerak di bidang tulisan dan ide keilmiahan.\r\nSelama berada di divisi literasi, saya mendapatkan beragam pengalaman seperti pengolahan esai dan serba-serbi keilmiahan yang dapat membantu saya dalam perkuliahan maupun diterapkan di dunia nyata.\r\nSaya pernah diamanahi sebagai Sekretaris-Bendahara dalam kegiatan Sosialiasasi National University Debate Championship dan Kompetisi Debat Mahasiwa Indonesia. Saya bertugas mengurus berkas dokumen yang berjumlah 15 lebih dibantu dengan rekan yang lain dan menjalin kerjasama dengan UKM BASIC sehingga saya terlatih dalam mengelola data besar, melatih ketelitian saya dan kemampuan untuk bekerja sama dalam tim.\r\nSetelah sosialiasi, Saya diamanahi untuk menjadi Ketua Pelaksana dalam kegiatan Pelatihan Delegasi Univeritas Jenderal Soedirman untuk mengikuiti Kompetisi Debat Mahasiswa Indonesia yang diadakan di bulan Mei. Kami menghadirkan mentor debat yang pernah berpartisipasi dan memenangkan Kompetisi Debat Mahasiswa Indonesia selama 8 pertemuan dan terseleksilah 1 mahasiswa sebagai delegasi yang akan mewakili Universitas Jenderal Soedirman.\r\nSekarang saya sedang tergabung dalam kegiatan Workshop Penulisan Esai (Suatu acara yang bertujuan melatih mahasiswa Universitas Jenderal Soedirman agar terampil dalam menyusun dan membuat esay yang berkualitas) yaitu sebagai Staff Divisi Humas sekaligus Pendamping Peserta sebanyak 10 orang selama kegiatan tersebut berlangsung sehingga dapat menjadi ladang pembelajaran bagi saya agar menjadi pribadi yang mendengarkan, mengayomi dan menuntun ke arah yang baik.\r\n\r\n- Staff Divisi Kajian Keilmuan dan Karya Tulis Ilmiah 2021\r\nDivisi K3TI adalah Divisi yang ada di Himpunan Mahasiswa Matematika yang bergerak di bidang kajian keilmuan guna membantu mahasiswa jurusan matematika dalam perkuliahan serta keilmuan ilmiah yang dapat memberikan bekal yang cukup bagi mahasiswa matematika yang tentunya bergerak dalam keilmiahan.\r\nSaya pernah tergabung dalam Kepanitiaan Sosialiasi Tugas Akhir dan Praktik Kerja Lapangan dengan target mahasiswa matematika angkatan 2020 keatas yang akan melaksanakan tugas akhir dan praktik kerja lapangan. Acara berakhir sukses dengan pembicara dan tamu undangan yang puas dengan acara yang telah disusun serta tercapainya target memberikan informasi terkait tugas akhir dan PKL yang dihadiri sebanyak 80 mahasiswa. Disini saya berlatih dalam penyiapan acara, sistematika dan mengikuti agenda secara struktural serta melatih komunikasi dengan orang yang lebih tua.\r\nSaya sekarang terpilih sebagai Staff Divisi Humas dari Kegiatan Festival Keilmahan MIPA 2022.\r\nSaya juga sekarang sedang menjalankan program kerja yang diamanahkan kepada saya yaitu sebagai Ketua Pelaksana Kunjungan Ilmiah Matematika UNSOED 2021, Kegiatan yang berupa kunjungan mahasiswa matematika ke instansi untuk mempelajari penerapan matematika yang ada di dalamnya. Kegiatan yang akan dilaksanakan pada tanggal 2 - 4 Agustus 2022 dengan target 45 peserta ini harus dipersiapkan secara matang. Saya jadi belajar bagaimana cara mengkoordinir berbagai divisi yang memiliki tugasnya masing-masing, disiplin waktu terhadap deadline dari timeline yang telah dibuat, bekerja sama dalam tim, rela berkorban dan berlatih time management.\r\n\r\n- Staff Divisi Teknologi ITC\r\nDivisi teknologi adalah Divisi yang ada di Unit Kegiatan Mahasiswa, Information Technology and Communication yang bergerak di bidang TIK sebagai wadah bagi mahasiswanya untuk mengembangkan skill TIK.\r\nSaya pernah diamanahi untuk menjadi Ketua Pelaksana kegiatan Pelatihan Pengurus dan Anggota #2 yang bertujuan untuk melatih pengurus dan anggota khususnya di bidang TIK. Acara berlangsung sukses dengan dihadiri 20 peserta dan saya mempelajari banyak hal khususnya dalam hardskill seperti cara mengedit video, fotografi, dan lain-lain.',	1,	1655280622,	NULL,	0),
('SCHLR-RYNRN-37bfaf',	'USR-RYNRN-fefb1',	'REYNARA ANDARU NANDIKO',	'2005-08-02',	'87867325498',	'Jl Sam Ratulangi Gg Bungsu Penengahan Raya',	'AKUNTANSI KEUANGAN LEMBAGA',	'SMK GAJAH MADA BANDAR LAMPUNG',	'0.00',	'3',	'Perkenalkan nama saya Reynara Andaru Saya berusia 16 tahun selain bersekolah saya juga suka membantu orang tua untuk mengelola usaha kecil-kecilan, sehingga hal inilah yang mendasari saya memiliki minat yang sangat besar terhadap dunia bisnis dan perbankan.\r\n',	'Saya juga bercita-cita untuk menjadi seorang Pengusaha yang sukses dan membangun sebuah perusahaan besar.\r\nCara saya saya mewujudkannya yaitu belajar dengan rajin,mengikuti pelatihan serta mengembangkan potensi keahlian dalam mengelola suatu bisnis.',	'Di sekolah saya mengikuti organisasi OSIS, di organisasi saya mempelajari  Skill kepemimpinan,mampu memecahkan masalah yang dihadapi,serta berkerjasama dengan anggota lainya.\r\nTerkadang jika ada program kerja yang dirasa sulit untuk dilaksanakan maka saya berusaha untuk menyelesaikan kesulitan tersebut,sehingga program kerja dapat terlaksanakan sesuai dengan yang direncanakan.',	1,	1654419975,	NULL,	0),
('SCHLR-RYNTM-6caa0a',	'USR-RYNTM-d3fe7',	'Aryanti Maharani Aprilia ',	'2002-04-09',	'81511364766',	'Jalan Rambutan Merpati Residence no 17, Jatimakmur, Pondok Gede, Bekasi',	'Kesehatan dan Keselamatan Kerj',	'Universitas Binawan',	'3.78',	'2',	'saya suka berbicara dan saling tukar pengetahuan dengan semua orang, saya  juga suka belajar hal-hal baru yang dapat menambah keterampilan saya',	'saya bermimpi menjadi safety officer di perusahaan BUMN khususnya PT.PERTAMINA persero.',	'saya mempunyai pengalaman organisasi, yaitu himpunan mahasiswa k3 yang ada di kampus saya. Menjalankan program kerja untuk memajukan himpunan dan pengetahuan',	1,	1654676231,	NULL,	0),
('SCHLR-RYSLY-0133ef',	'USR-RYSLY-67dd4',	'Royis Ilyas',	'2000-06-16',	'83113893785',	'Jurgang, Juruan Laok, Batuputih, Sumenep, Jawa Timur.',	'Dirasat Islamiyah ',	'UIN Syarif Hidayatullah Jakart',	'3.58',	'2',	'Saya orangnya sangat ambisius sekali dalam belajar, saya sering sekali mencari ilmu ilmu baru yang sekiranya bisa saya amalkan kelak dimasyarakat, baik ilmu itu diperoleh di ruang kelas maupun di luar kelas . Dan saya SD sering iri ketika melihat orang-orang yang sudah sukses, saya perpikir saya pasti bisa seperti mereka juga meskipun dengan keadaan yang seperti ini. Saya yakin ekonomi bukan masalah dalam menuntut ilmu. Bismillah ',	'Mimpi terbesar saya adalah ingin merubah nasib kehidupan keluarga saya, saya orang desa yang keadaan ekonominya pun pas Pasan, jadi saya kuliah itu bukan karena mampu dalam segi ekonomi, tapi orang tua saya berharap semoga nasib saya kedepan tidak seperti mereka. Cacian dan cemooh dari tetangga seringkali menghantam hati kami, tapi dengan izin Allah saya akan buktikan bahwa saya juga bisa sukses meskipun dengan keadaan pas Pasan. Cara saya mewujudkan mimpi itu tentunya dengan belajar yang sungguh sungguh, agar yang saya impikan bisa menjadi kenyataan. Amiin',	'Dalam masa pendidikan saya sejak Mts, saya suka yang namanya mencari ilmu dan mengandi, jadi saya berharap disamping saya dapat ilmu saya juga dapat mengais barokah. Sejak Mts saya aktif sebagai Pengurus OSIS lebih tepatnya sebagai Wakil ketua di waktu kelas VIII, dan di watu kelas IX Mts saya juga aktif sebagai Pengurus DPS ( Dewan Perwakilan Siswa). Waktu terus berlanjut di waktu kelas X saya sudah diangkat jadi pengurus OSIS bagian Divisi 1 yaitu tentang Pendidikan, dan waktu saya kelas XI saya dipercayai dan di beri amanah sebagai terpilih sebagai ketua OSIS, dan di waktu yang sama saya juga dipercayai atau terpilih sebagai ketua OSIS Madrasah Diniyah di pondok Pesantren Annuqayah Lubangsa, jadi  jadi waktu itu dalam setahun saya megang dua Organisasi sekaligus, dan Alhamdulillah saya bisa menjalaninya, di waktu kelas XII saya juga dipercayai oleh pimpinan sekolah dan teman teman untuk menjadi Kordinator MPO ( Majelis Pertimbangan OSIS). Dari situ saya belajar bagai mana saya harus punya pemikiran yang lebih luas lagi, yang mana saya tidak boleh mengedepankan ego sendiri tapi harus juga memikirkan keadaan orang orang disekitar saya. Tidak sampai disitu, saya akhirnya melanjutkan pendidikan di UIN Syarif Hidayatullah Jakarta, yaitu di Fakultas Dirasat Islamiyah, disana saya aktif di berbagai Organisasi, baik organisasi intenal kampus maupun Eksternal kampus, dari hal itu banyak pembelajaran baru yang sebelumnya belum saya dapat di pondok dulu. Sekarang ini (di semester II) saya juga terpilih menjadi salah satu pengurus Dema yaitu di bidang (Pengkaderan). Dan di organisasi Eksternalpun saya juga di percayai sebagai pengurus Komisariat khusunya di bidang Pengkaderan juga. dan pernah diwaktu saya masih Maba saya dipercayai langsung untuk ikut bergabung atau menjadi panitia Kemah Bahasa Arab (KBA) yang diselenggarakan oleh Organisasi Persatuan Mahasiswa Bahasa Arab se-Indonesia (ITHLA). Jadi dari situ saya merasa dilatih menjadi dewasa, yang mana skill harus saya kembangkan tanpa harus mengorbankan pendidikan pendidikan akademik lainnya.',	1,	1653668363,	NULL,	0),
('SCHLR-RYWJY-fffd90',	'USR-RYWJY-aba0c',	'Aryawijaya Adibrata',	'2003-10-02',	'85842730323',	'Jalan Bantul Dongkelan No.8A, Panggungharjo, Sewon, Daerah Istimewa Yogyakarta',	'Studi Pembangunan',	'Institut Teknologi Sepuluh Nop',	'3.50',	'0',	'Saya Aryawijaya Adibrata, umur 18 tahun. Saat ini saya adalah calon mahasiswa baru jurusan studi pembangunan di Institut Teknologi Sepuluh Nopember. Meskipun latar belakang akademis saya di bidang sosial, namun saya juga memiliki cukup pengalaman di bidang sains, terutama robotik dimana saya memiliki prestasi mulai dari tingkat nasional hingga internasional. Itu karena saya adalah orang yang memiliki curiosity atau rasa ingin tahu yang tinggi terhadap semua bidang ilmu pengetahuan. Jika saya ditanya apa mata pelajaran yang saya suka, dan apa mata pelajaran yang paling saya tidak suka, saya tidak bisa menjawabnya karena saya menyukai semua mata pembelajaran dan selalu cinta belajar, karena bagi saya, ilmu adalah apa yang membuat manusia terus berkembang. Dari semua itu saya bisa belajar untuk memiliki beberapa keahlian yang saya punya mulai dari kemampuan dasar microsoft office, mendesain melalui Fusion 360, melakukan pemrograman HTML, CSS, Javascript, dan Python, serta menganalisis menggunakan SPSS.',	'Saya memiliki mimpi untuk bisa menciptakan terobosan baru untuk Indonesia di bidang teknologi, dan saya sudah mempunyai rencana bagaimana saya akan melakukannya. Saat saya sudah akan aktif di ITS, saya akan bergabung ke organisasi mahasiswa Bayucaraka ITS yang berfokus pada pengembangan UAV atau pesawat tanpa awak, disitu saya akan mengajukan proposal untuk membuat UAV pseudo-satellite yang sudah saya rancang. UAV tersebut dibuat untuk memecahkan rekor MURI dengan melakukan penerbangan selama 10 hari nonstop. Rencana B nya adalah, saya akan membuat UAV tersebut bersama adik saya menggunakan uang beasiswa dan mengajukan ke PKM-K untuk diikut sertakan ke pimnas dan tetap mencoba meraih rekor MURI. Setelah itu, dengan menggunakan pengalaman tersebut, saya akan kembali mengajukan proposal proyek ke Bayucaraka atau ke pihak ITS langsung untuk membuat roket sonda satu tingkat berbahan bakar padat (menggunakan bahan bakar ammonium perklorat atau APCP) yang akan kembali mencetak rekor MURI sebagai yang pertama yang mampu mencapai garis karman (100 km).',	'Saya mulai aktif ikut organisasi semenjak saya SMP dimana organisasi pertama yang saya ikuti adalah ekstrakurikuler robotik, rohani islam, dan organisasi PIK-R (Pusat Informasi Konseling Remaja) dimana disitu, dibawah naungan BKKBN, saya banyak melakukan penyuluhan tentang banyak materi mulai dari bahaya NAPZA, kesehatan reproduksi, dll ke banyak Sekolah Dasar. Diluar sekolah, saya bergabung dengan Laskar Lingkungan Muda (LLM) Tangerang Selatan yang berada dibawah naungan dinas lingkungan hidup. Disitu saya banyak ikut kegiatan sukarelawan sebagai aktivis lingkungan dengan membantu membersihkan sampah2 di kota, terutama saat Car Free Day. Disaat SMA, karena belum ada ekskul robotik, maka saya bertekad untuk berani mendirikan ekskul robotik. Dalam 3 bulan pertama, saya bersama dengan tim dari ekskul robotik saya berhasil membuat robot kapal pembersih sampah dan meraih juara 1 di Kompetisi Robot Nusantara (KRON) 2019 di kategori robot kreatif',	1,	1655739744,	NULL,	0),
