('SCHLR-RZKYF-04d422',	'USR-RZKYF-4a89f',	'Rizki ayu afrianti ',	'2002-04-03',	'87704190837',	'JL.URIP SUMIHARJO',	'teknologi pendidikan fakultas ',	'universitas negeri makassar',	'3.79',	'2',	'saya adalah anak mahasiswa yang sekarang sedang semester 2 di universitas negeri makassar.',	'mimpi ku ialah membahagiakan kedua orang tua dengan cara melakukan dan melaksanakan apa yang mereka inginkan selama hal itu baik',	'waktu sma masuk di organisasi belajar bahasa inggris',	1,	1655263108,	NULL,	0),
('SCHLR-RZKYH-7cbce9',	'USR-RZKYH-2c367',	'RIZKY HILMIANTO',	'2002-11-25',	'81218155982',	'jl. malaka iii',	'as',	'unj',	'3.90',	'2',	'fs',	'zs',	'ds',	1,	1654769792,	NULL,	0),
('SCHLR-RZKYP-82e78e',	'USR-RZKYP-29ebc',	'Rizky Perwira',	'2000-05-30',	'85158117364',	'Jl.Pane no 130 C Pematangsiantar Sumatra Utara',	'Teknik Industri',	'Universitas Diponegoro',	'3.27',	'6',	'Nama saya adalah Rizky Perwira dan saat ini saya masih menempuh semester 6 dengan mengambil jurusan Teknik Industri di Universitas Diponegoro.Saya juga sedang menjalani pekerjaan Remote Freelance Sustainability impact analyst di Impaakt.Dimana saya bertugas mereview impact Dari perusahaan berdasarkan data CSR perusahaan dan laporan lembaga non profit lainnya sesuai dengan pedoman SDGS.Saya juga merupakan orang yang mudah beradaptasi dan berbaur dengan berbagai tipe orang.Hal ini dikarenakan sewaktu SMA saya pernah hidup berasrama.Saya juga merupakan orang yang sangat kompetitif Dan meyukai tantangan.Hal ini dikarenakan sejak kecil saya sudah mengikuti banyak turnamen catur,dan hingga saat ini sudah meraih gelar Fide Arena Candidate Master dari World Chess Federation.Saya juga merupakan pribadi yang selalu berusaha meningkatkan skill saya.Hal ini terbukti dari beberapa kursus yang telah saya ikuti seperti kursus digital marketing, Google Analytics dari Google, Risk Management dari open University dan yang lainnya.Prestasi saya yang cukup berkesan bagi saya ialah ketika saya mendapatkan peringkat ketiga pada kompetisi Trading Forex yang diikuti oleh lebih dari 500 orang dari berbagai negara yang diselenggarakan oleh Stocktrak.Saya juga orang yang cukup aktiff berkegiatan Dan besosialisasi,terbukti saya pernah mengikuti beberapa program Student Ambassador,panitia lomba dan volunteering.\r\n\r\nHarapannya, dengan pengalaman tersebut, saya bisa mendapatkan beasiswa ini agar saya bisa mengembangkan diri saya secara lebih lagi dan membantu meringankan beban finansial keluarga mengingat saya akan memasuki tahun terakhir perkulihan dan akan melalukan persiapan penelitian dan skripsi,serta juga bisa menjadi motivasi bagi saudara saya untuk melalukan Hal yang sama.\r\n',	'Saya memiliki cita-cita untuk memajukan kampung halaman saya yaitu daerah Toba dan sekitarnya.Karena di samping potensi wisatanya yang berlimpah,SDM nya sendiri juga memiliki potensi yang besar.Namun keterbatasan fasilitas dan infrastruktur membuat daerah ini sulit maju.Untuk saat ini,cara saya mewujudkannya mungkin dengan membantu meningkatkan potensi SDM nya dengan cara menjadi relawan Toba Mengajar,yang berusaha untuk meningkatkan literasi computer pada masyarakat disana.Saya juga pastinya akan berusaha untuk meningkatkan karir saya dan diri saya agar saya bisa menjadi manusia yang memiliki pengaruh dan resource untuk membuat dampak yang lebih besar seperti yang dilakukan Founder SMA saya ,SMA Unggul Del yaitu Bapak Luhut Panjaitan.Beliau telah menginspirasi banyak dari kami para alumnus untuk mendirikan tipe sekolah yang sama dengan yang beliau dirikan.',	'Saya merupakan orang yang cukup senang berkegiatan dan membangun relasi.Saya pernah mendapatkan kesempatan menjadi Student Ambassador untuk organisasi SVB Academy dan Sinarmas Techconnect,dimana saya bertugas meningkatkan brand awareness mereka melalui Media sosial dan juga membantu mendesain konten mereka di Instagram.Saya juga pernah menjadi panitia Hypnosmith International Writing Competition,dimana saya menjadi Registration Comitee dan memiliki tugas mendesain form pendaftaran para peserta dan mereview aplikasi pendaftaran para peserta.Terakhir,saya pernah bertugas sebagai relawan di organisasi Get Your Dreams, sebagai staff Social Care Team,yang dimana saya bertugas memberikan dukungan emotional kepada para korban trauma masa kecil,yang dimana tetap didampingi oleh psikolog.',	1,	1655736893,	NULL,	0),
('SCHLR-RZLYD-352180',	'USR-RZLYD-75966',	'Rizal Yudhiawan ',	'2003-03-18',	'8979327529',	'Jl. Kemanggisan Ilir rt/11 rw/ 06 Kec. Palmerah, Kel. Kemanggisan, Jakarta Barat 11480',	'S-1 Teknik Industri ',	'Universitas Singaperbangsa Kar',	'3.67',	'2',	'Saya merupakan pribadi yang mandiri, saya suka berbaur dengan orang baru, saya suka bermain sepak bola bermain dialam bebas, saya juga suka membaca buku, novel dll.',	'Menjadi mahasiswa berprestasi atau mendapatkan beasiswa untuk meringankan uang semester ku.\r\nCara nya: saya mengikuti event-event yang membuat saya tertarik untuk mengikuti nya entah itu event lomba dan beasiswa ',	'Ya punya, ketika saya sekolah SMA saya pernah masuk ke organisasi pecinta alam disana saya di ajarkan cara nya menghargai sesama manusia, saling membantu, saling tolong menolong, organisasi ini bergerak ke arah lingkungan manusia ',	1,	1655104514,	NULL,	0),
('SCHLR-RZQLP-4c5c43',	'USR-RZQLP-2d5a3',	'RIZQI AULIA PUTRI ANJU',	'2005-05-27',	'81523992186',	'Dusun kunjung desa Banyuanyara kec Sanrobone',	'S1 kebidanan',	'Institut Pelamonia Makassar',	'3.98',	'1',	'Perkenalkan nama saya Rizqi Aulia Putri Anju saat ini saya akan melanjutkan pendidikan saya ke jenjang yang lebih tinggi lagi',	'Ingin membanggakan kedua orang tua dengan cara mencapai cita cita saya menjadi seorang bidan ',	'Pada saat SMA saya merupakan salah satu dari anggota OSIS di bidan pendidikan pendahuluan dan bela negara',	1,	1655701094,	NULL,	0),
('SCHLR-RZVLT-23aff0',	'USR-RZVLT-06354',	'Reza Violita Dwike Putri Dewi',	'2004-02-04',	'82297653398',	'JL.Keranjalembah',	'Jurusan Ilmu Hukum Fakultas Hu',	'Universitas Tadulako ',	'3.84',	'2',	'Saya memiliki kepribadian yang sangat baik, mampu beradaptasi dengan lingkungan sekitar. Dan saya juga termasuk pecinta hewan.',	'Saya bercita-cita sebagai seorang pengacara, dan cara mewujudkannya dengan belajar dengan bersungguh-sungguh karena tidak ada yang tidak mungkin selagi kita berusaha dan berdoa.',	'Saya pernah mengikuti organisasi PIK-R pada saat masih SMA dimana dalam organisasi tersebut saya dapat belajar bahwa setiap orang mempunyai masalah yang harus mereka hadapi masing-masing. Dan tidak sedikit mereka memerlukan teman untuk mendengarkan apa yang sebenarnya mereka inginkan. Karena bisa jadi mereka hanya memasang wajah keceriaan kepada orang lain sehingga orang lain tidak tahu apa yang sebenarnya mereka lalui.',	1,	1654077868,	NULL,	0),
('SCHLR-RZVLT-d507fc',	'USR-RZVLT-06354',	'Reza Violita Dwike Putri Dewi',	'2004-02-04',	'82297653398',	'JL.Keranjalembah ',	'Jurusan Ilmu Hukum fakultas Hu',	'Universitas Tadulako',	'3.84',	'2',	'Saya memiliki kepribadian yang sangat baik, mampu beradaptasi dengan lingkungan sekitar. Dan saya juga termasuk pecinta hewan.',	'Saya bercita-cita sebagai seorang pengacara, dan cara mewujudkannya dengan belajar dengan bersungguh-sungguh karena tidak ada yang tidak mungkin selagi kita berusaha dan berdoa.',	'Saya pernah mengikuti organisasi PIK-R pada saat masih SMA dimana dalam organisasi tersebut saya dapat belajar bahwa setiap orang mempunyai masalah yang harus mereka hadapi masing-masing. Dan tidak sedikit mereka memerlukan teman untuk mendengarkan apa yang sebenarnya mereka inginkan. Karena bisa jadi mereka hanya memasang wajah keceriaan kepada orang lain sehingga orang lain tidak tahu apa yang sebenarnya mereka lalui.',	1,	1654077456,	NULL,	0),
('SCHLR-SBRNF-05c69b',	'USR-SBRNF-dcf8a',	'Sabrina Fairuz Salsabila',	'2007-11-19',	'85366726090',	'Jl. Sentosa lorong sri raya 3 no. 33 rt. 41 rw. 15, KOTA PALEMBANG, PLAJU, SUMATERA SELATAN, ID, 30266',	'Smk Desain Komunikasi Visual',	'Smk Negeri 6 Palembang',	'0.00',	'1',	'Hi, Nama Saya Sabrina Fairuz Salsabila. Saya akan lulus Smp. Saya seorang yang sangat menyukai mencoba hal-hal baru, saya akan merasa sangat disayangkan apabila saya tidak mencoba padahal saya bisa ataupun sebaliknya. Saya sangat suka bekerja-sama dalam suatu kelompok baik dalam event tertentu atau apapun. Meski mengalami kendala saya akan mencoba yang terbaik dalam hal mengatasi masalah tersebut.\r\n',	'\r\nJujur saja mimpi saya adalah untuk pergi keluar negeri. Saya terus belajar agar dapat memasuki Sma terfavorit, namun pembelajaran jarak jauh membuat hal tersebut menjadi sulit. Nilai saya selisih tipis agar dapat mengikuti ujian masuk Sma, sedih sih. Tapi ya sudahlah saya tidak bisa mengubah masa lalu tapi saya akan mengubah masa depan. Masuk smk mungkin sulit untuk masuk kuliah, maka dari itu saya bertekad untuk memperlajari ilmu yang ada disana dan menerapkannya dalam kehidupan saya.\r\n\r\n',	'Pengalaman relawan yang saya miliki adalah saat saya membuat mading perwakilan kelas saya. Saat itu ada sejumlah orang yang mengajukan diri untuk ikut andil di dalamnya termasuk saya. Pada awalnya proses kerja berjalan lancar. Dipertengahan proses kerja mulai terhambat, banyak anggota relawan yang mulai tidak hadir dengan berbagai alasan. Saya mendapat bagian keuangan, tugas yang sangat banyak memiliki tanggung jawab. Saya juga memiliki pengalaman dibidang keuangan, karena hal itulah saya tau seberapa beratnya tugas pemegang keuangan. Ada dua orang yang masih terus mengerjakan mading secara perlahan bersama saya. Sebut saja Bella dan Yora, dialah yang suka berpergian bersama saya membeli barang tapi Bella orang yang membeli barang tidak peduli harganya. Asalkan barang ada dia akan membelinya, Sebagai keuangan tentu saya akan memberikannya namun mengingat anggaran yang kami miliki sangat kecil saya menyarankannya untuk mencari yang murah namun kualitas tetap sama. Bella menerima saran saya, dan kami berbelaja barang yang dibutuhkan. Saat pulang saya akan mencatat pengeluaran, benda apa yang dibeli, berapa harganya, dan tanggal berapa bersama siapa. Ada kalanya Bella tidak berbelanja bersama saya tapi dengan Yora, Saya akan memberi anggaran setengahnya dan bertanya kembali pada mereka apa yang mereka beli dan berapa harganya. Yora dan Bella agak bar-bar kalo berbelaja karena itu kadang saya akan mengawasi apa yang mereka beli. Singkat cerita setelah banyak diskusi dan pertemuan, delapan puluh persen mading berhasil dibuat. Bella menawarkan diri untuk melakukan hiasan akhir, kami setuju. Tapi masalahnya Bella meminjam uang salah satu relawan dan uang anggaran tidak cukup menutupi itu. Saya menyarankan untuk pengambilan dana lagi pada anggota kelas dengan nominal sedikit mungkin dan syukurlah semua orang menerima saran saya. Terimakasih dan maaf jika cerita saya membosankan.',	1,	1654061989,	NULL,	0),
('SCHLR-SBRNF-cd3b4c',	'USR-SBRNF-dcf8a',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654061367,	NULL,	0),
('SCHLR-SBRNF-f974bf',	'USR-SBRNF-dcf8a',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654061315,	NULL,	0),
('SCHLR-SBRNF-ffc414',	'USR-SBRNF-dcf8a',	'Sabrina Fairuz Salsabila',	'2007-11-19',	'85366726090',	'Sbrinafairuzsalsabila@gmail.com',	'Smk Desain Komunikasi Visual',	'Smk Negeri 6 Palembang',	'0.00',	'1',	'Hi, Nama Saya Sabrina Fairuz Salsabila. Saya akan lulus Smp. Saya seorang yang sangat menyukai mencoba hal-hal baru, saya akan merasa sangat disayangkan apabila saya tidak mencoba padahal saya bisa ataupun sebaliknya. Saya sangat suka bekerja-sama dalam suatu kelompok baik dalam event tertentu atau apapun. Meski mengalami kendala saya akan mencoba yang terbaik dalam hal mengatasi masalah tersebut.',	'Jujur saja mimpi saya adalah untuk pergi keluar negeri. Saya terus belajar agar dapat memasuki Sma terfavorit, namun pembelajaran jarak jauh membuat hal tersebut menjadi sulit. Nilai saya selisih tipis agar dapat mengikuti ujian masuk Sma, sedih sih. Tapi ya sudahlah saya tidak bisa mengubah masa lalu tapi saya akan mengubah masa depan. Masuk smk mungkin sulit untuk masuk kuliah, maka dari itu saya bertekad untuk memperlajari ilmu yang ada disana dan menerapkannya dalam kehidupan saya.',	'Pengalaman relawan yang saya miliki adalah saat saya membuat mading perwakilan kelas saya. Saat itu ada sejumlah orang yang mengajukan diri untuk ikut andil di dalamnya termasuk saya. Pada awalnya proses kerja berjalan lancar. Dipertengahan proses kerja mulai terhambat, banyak anggota relawan yang mulai tidak hadir dengan berbagai alasan. Saya mendapat bagian keuangan, tugas yang sangat banyak memiliki tanggung jawab. Saya juga memiliki pengalaman dibidang keuangan, karena hal itulah saya tau seberapa beratnya tugas pemegang keuangan. Ada dua orang yang masih terus mengerjakan mading secara perlahan bersama saya. Sebut  saja Bella dan Yora, dialah yang suka berpergian bersama saya membeli barang tapi Bella orang yang membeli barang tidak peduli harganya. Asalkan barang ada dia akan membelinya, Sebagai keuangan tentu saya akan memberikannya namun mengingat anggaran yang kami miliki sangat kecil saya menyarankannya untuk mencari yang murah namun kualitas tetap sama. Bella menerima saran saya, dan kami berbelaja barang yang dibutuhkan. Saat pulang saya akan mencatat pengeluaran, benda apa yang dibeli, berapa harganya, dan tanggal berapa bersama siapa. \r\nAda kalanya Bella tidak berbelanja  bersama saya tapi dengan Yora, Saya akan memberi anggaran setengahnya dan bertanya kembali pada mereka apa yang mereka beli dan berapa harganya. Yora dan Bella agak bar-bar kalo berbelaja karena itu kadang saya akan mengawasi apa yang mereka beli. Singkat cerita setelah banyak diskusi dan pertemuan, delapan puluh persen mading berhasil dibuat. Bella menawarkan diri untuk melakukan hiasan akhir, kami setuju. Tapi masalahnya Bella meminjam uang salah satu relawan dan uang anggaran tidak cukup menutupi itu. Saya menyarankan untuk pengambilan dana lagi pada anggota kelas dengan nominal sedikit mungkin dan syukurlah semua orang menerima saran saya. \r\n\r\nTerimakasih dan maaf jika cerita saya membosankan.',	1,	1654060512,	NULL,	0),
('SCHLR-SBSTN-1f12fc',	'USR-SBSTN-58a7f',	'Sebastian Meindi',	'2001-05-22',	'81511218570',	'Jl. Bukit Cimanggu Villa Blok U2 no.12A, Kec. Tanah Sereal, Kota Bogor, Jawa Barat, 16166',	'Fakultas Teknik Jurusan Teknik',	'Universitas Jenderal Soedirman',	'3.10',	'4',	'Aku adalah seorang anak dari keluarga yang sederhana, seorang abang yang memiliki 2 adik. Dari kecil aku sering berpindah pindah kota bahkan pulau mengikuti pekerjaan orang tua yang sering berpindah tugas hingga akhirnya menetap di Bogor sampai saat ini. Lingkungan keluarga sangat berpengaruh pada perkembangan ku, walau dulu tidak terasa. Apapun yang ingin dilakukan, keputusan yang ingin diambil selalu dikritisi oleh orangtua. Dikritisi bukan di tolak. Dibalik semua itu sebenarnya mereka mendukung, namun ingin menguatkan tekad atau mentalku saja. Bahkan, sampai sekarang aku menganggap mereka seperti teman konsultasi. Aku adalah orang yang sangat gampang bergaul, namun gampang juga untuk terbawa arus yang tidak baik. Dari kecil tempatku belajar selalu berpindah tempat, tidak setiap tahunnya pindah tapi setiap melangkah ke derajat yang lebih tinggi. Ini bukan karena memiliki masalah tetapi ingin mencari suasana yang baru, sanguinis. Hal itu menuntut diri sendiri untuk bisa cepat beradaptasi dengan lingkungan sekitar, tapi sejauh ini masih baik baik saja. Sampai di jenjang perkuliahan, adaptasi tersebut sangat berguna. Jauh dari rumah, lingkungan; bahasa maupun budaya yang sangat berbeda sangat menuntut untuk bisa beradaptasi akan hal tersebut dan untungnya aku punya bekal itu.',	'Dari kecil, aku memang tidak seperti anak anak pada umumnya yang memiliki cita cita atau mimpi yang besar. Entah mengapa bisa begitu, tetapi itu kenyataannya. Sampai saat aku melihat abang dari ibuku yang saat itu bekerja sebagai Teknik Sipil, saat itu juga lah aku mempunyai mimpi yang besar. Aku ingin menjadi seorang insinyur yang dapat membanggakan orangtua dan menjadi contoh untuk adik-adikku. Dengan bekal pengalaman yang dialami paman dan juga pembelajaran di perkuliahan, aku ingin hal itu terwujud. Mulai dari sering bertanya tentang akademik melalui kaka tingkat, suasana pekerjaan, maupun pengalaman pengalaman yang sudah mereka lalui. Karena menurutku, pengalaman seseorang itu sangat berpengaruh dan tidak semua orang memiliki pengalaman yang sama. Sehingga mempunyai berbagai sudut pandang itu sangat berharga.',	'Saat SMA tepatnya pada kegiatan masa pengenalan lingkungan sekolah, aku melihat beberapa seniorku yang menjadi OSIS. Ada yang berwibawa, berkarakter, sampai ada yang menjengkelkan. Pada saat itu pengalaman berorganisasiku masih sangat minim, hanya sebatas sebagai pemuda lingkungan rumah yang mengurusi kegiatan kegiatan disana. Karena hal tersebut dan kebetulan juga aku belum tau ingin mengikuti kegiatan apa, aku mencoba daftar OSIS pada tahun itu. Dan akhirnya setelah mengikuti beberapa rangkaian seperti materi pembekalan, LDK dan lain sebagainya aku terpilih menjadi OSIS di bidang yang aku minati yaitu olahraga. Setelah terpilih ternyata sangat berbeda antara OSIS dengan Karang Taruna di lingkungan rumahku. Sangat terstruktur, banyak campur tangan dari beberapa pihak sangat membatasi kreatifitas para OSIS. Sehingga tahun depannya aku tidak mengikuti lagi dan beralih menjadi pengurus dalam lingkungan Pemuda Gereja dengan bidang yang sama, olahraga. Berbeda lagi dengan organisasi sekolah maupun organisasi lingkungan rumah, lingkungan Gereja memang cukup sulit untuk melakukan pendekatan karena rentang usia yang relatif jauh serta pemikiran setiap pengurus yang sebanding dengan usia. Tapi, dengan itu banyak manfaat seperti mengetahui berbagai sudut pandang dengan berbagai pengalaman yang sudah dilalui setiap pengurusnya. Setelah lulus SMA, kepengurusan yang aku jalani itu sudah beralih dan aku tidak mengikutinya lagi. Aku ingin beristirahat dan fokus untuk tes masuk kuliah. Di perkuliahan, aku menjadi pengurus di himpunan jurusan karena ingin melanjutkan pengalaman berorganisasi pribadi. Sama dengan tingkat SMA, setelah melewati berbagai rangkaian yang tidak jauh berbeda akhirnya terpilih menjadi staff di divisi kaderisasi. Singkat cerita kepengurusan dilakukan secara hybrid, dikarenakan wabah covid-19. Tahun ini, aku dipercaya oleh teman teman untuk menjadi Ketua Himpunan Mahasiswa Teknik Sipil Universitas Jenderal Soedriman periode 2022.',	1,	1655742790,	NULL,	0),
('SCHLR-SBTHF-082be3',	'USR-SBTHF-a43d6',	'Sabitah fairuz salsabilla',	'2007-11-19',	'82113023297',	'Jln.sentosa lr. Sriraya 3 no 33 rt. 41 rw. 15',	'Tataboga',	'Smk 6 palembang',	'0.00',	'1',	'Perkenalkan nama saya sabitah fairuz salsabilla. Biasa di panggil tata. Saat ini saya baru saja menjadi pelajar di smk 6 jurusan tataboga. Sebelumnya saya aktif dalam dibidang pengetahuan sehingga selama 3 tahun di smp saya pernah berada di peringkat tiga hingga enam besar. Selain itu saya juga aktif dalam kegiatan kelas seperti membuat pojok bacaan hingga berpartisipasi dalam pembuatan mading antar kelas. saya ingin memperluas pengalaman saya dengan mengikuti beasiswa ini dan meningkatkan kemampuan skill yang saya miliki. ',	'Mimpi saya adalah membuka sebuah kafe di mana semua pelanggan yang datang bisa merasakan manis dan lembutnya sebuah kue tampa merusak kesehatan hingga orang\" yang menggalami diabetes pun bisa merasakannya.. \r\n\r\nSaat ini saya telah mempelajari sedikit demi sedikit tentang tataboga terutama dunia kue. Serta pelajaran tentang gizi.',	'Saat di kegiatan ekstrakulikuler paskip, saya melakukan sesi latihan PBB bersama dengan sekolah smp lain. Saya juga ikut serta dalam menghias sekolah dengan membuat pot dari bahan botol bekas',	1,	1653994310,	NULL,	0),
('SCHLR-SCSKM-98ace1',	'USR-SCSKM-70515',	'Suci Sukma Putri',	'2003-08-08',	'89502947378',	'Jalan Rorotan IX RT 09/RW 07, Jakarta Utara,DKI Jakarta',	'Pendidikan Bahasa Jerman/Fakul',	'Universitas Negeri Jakarta',	'3.05',	'2',	'Saya sekarang berumur 18 tahun. Saya merupakan seorang mahasiswa di Universitas Negeri Jakarta,di jurusan bahasa Jerman. Ayah saya sudah meninggal dunia dan ibu saya bekerja sebagai pedagang. Saya mempunyai 1 adik.',	'Mimpi terbesar saya adalah membuat bangga orang tua saya dan membahagiakan orang tua saya dan cara saya mewujudkannya adalah dengan belajar dan menjadi anak yang baik. Tidak hanya itu saya juga berniat untuk melanjutkan studi saya di luar negeri dan cara saya mewujudkannya adalah dengan belajar dan mencari beasiswa. Saya juga ingin sekali menolong diantara sesama.',	'Pengalaman organisasi saya adalah saya sewaktu SMA pernah menjadi anggota PMR dan Bantara. Serta saya juga pernah menjadi relawan menanam pohon mangrove dan panitia untuk donor darah. Untuk di saat kuliah ini saya sedang mengikuti organisasi Sigma TV UNJ dan Tim Pembela Mahasiswa (TPM)',	1,	1654017812,	NULL,	0),
('SCHLR-SFNHN-04a4af',	'USR-SFNHN-e2382',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654495897,	NULL,	0),
('SCHLR-SFRRL-0909fe',	'USR-SFRRL-82fb0',	'Safira Auralia',	'2001-09-05',	'81262408612',	'Jl.Pembangunan Gg.Pribadi No.3 ',	'antropologi sosial',	'Universitas Sumatera Utara',	'3.39',	'2',	'Saya adalah seorang Mahasiswi dari USU semester 4. Saya berasal dari Jurusan Antropologi. Saya anak ke 3 dari 4 bersaudara. Saya memiliki sifat yang mudah bersosialisasi, beradaptasi, saya juga rajin, saya adalah orang yang perasa, karena saya selalu memikirkan orang lain daripada diri sendiri. Saya mengikuti organisasi Hmpunan Mahasiswa Jurusan dan Ksei FoSEI USU, saya juga telah mengikuti beberapa kepanitiaan. saya juga memiliki sikap penyayang terhadap anak kecil, karena saya gemar dan senang kepada mereka. Saya orangnya mudah tersinggung jika tidak sesuai kenyataan atau sesuatu yang saya tida bisa terima, tetapi saya cenderung harus memperhatikan suasan dan situasi.',	'Mimpi semua orang adalah sukses. saya ingin mendapat beasiswa karena impian saya dari sejak SMA, saya berusaha mendaftar beasiswa dimanapun tetapi selalu ditolak, bahkan sampai wawancara pun saya tetap ditolak. Saya juga ingin mewujudkan mimpi saya untuk setelah S1, saya melanjutkan S2 untuk pendidikan saya. Karena bagi saya bukan soal tinggi atau gelar sarjana. tetapi wanita harus juga memiliki potensi dan wawasan yang luas dalam segala bidang. Dengan duduk di bangku kuliah membuka pikiran untuk lebih dewasa',	'Ya punya, saya mempunyai pengalaman organisasi dalam kepanitiaan. Di tahun 2021 saya menjadi Co PTT untuk acara DEI. Saya menjadi anggota acara dalam kegiatan Aku USU 2021. Saya menjadi Co PTT dan Pubdok untuk Mubes Ksei FoSEI USU. Saya juga pernah menjadi volunteer saat 2021 selama 6 Bulan di Rimbaraya Indonesia, bagaimana sikap kita seagai manusia dalam melindungi alam merawatnya sebaik mungkin dan cara penanggulangan atau pencegahan jika terjadi kerusakan di Bumi',	1,	1655744437,	NULL,	0),
('SCHLR-SHBNJ-deb58b',	'USR-SHBNJ-bf1d0',	'Shabina Jasmine qothrunnadaa',	'2002-10-13',	'8970840035',	'Jln. Raya grengseng rt.03 rw. 010 no.10 desa taraban, kec. Paguyangan, kab. Brebes',	'Tadris Bahasa Inggris/Fakultas',	'UIN Prof. K.H. Saifuddin Zuhri',	'3.55',	'4',	'nama saya shabina jasmine qothrunnadaa, biasa dipanggil jasmine ketika dilingkungan sekolah tetapi di panggil yasmin atau yaya ketika dilingkungan keluarga. saya lahir pada tanggal 13 oktober 2002, dikabupaten brebes yang terkenal dengan telor asin dan bawang merahnya, dan merupakan anak kedua dari 4 bersaudara. hobi saya antara lain yaitu menonton film, drakor dan mendengarkan lagu baik lagu indo, western, bahkan korea baik lagu dari boygroup maupun girlgroup. Saya pernah memiliki beberapa cita-cita diantaranya pramugari, menjadi seorang psikolog, pikiran saya untuk menjadi guru baru muncul saat-saat mendekati masa ujian akhir di sma saya. saya merupakan seorang mahasiswi semester 4 yang saat ini sedang menempuh jurusan tadris bahasa inggris atau di sebut juga pendidikan bahasa inggris di salah satu universitas di kota tetangga tempat rumah saya berada yaitu UIN Prof. K.H. Saifuddin Zuhri. saya juga salah satu mahasiswi di angkatan yang masa pengenalan kampus dan waktu awal kuliahnya banyak dihabiskan di depan layar handphone, maupun laptop, iya masa awal kuliah saya dimulai pada saat pandemik covid-19 mulai merebak, dan pada masa itupun kondisi keuangan keluarga saya ikut menurun yang mana pastinya tidak hanya kondisis keuangan keluarga saya saja yang menuntun tetapi mestinya keluarga yang lain pun merasakannya. setelah pandemi covid-19 memang terdapat peningkatan, namun tidak berlangsung lama karena, beberapa kali terjadi kecelekaan pada ayah dan ibu saya yang kesehatannya terus-menerus menurun sehingga harus beberapa kali keluar masuk rumah sakit. tentunya karena hal-hal tersebut juga mempengaruhi kondisi keuangan keluarga kami karena kedua orang tua kami yang tidak bisa menjalankan pekerjaan mereka dengan seperti biasa. Ya, kedua orang tua saya adalah seorang pedagang, untuk sekarang mereka masih memiliki 3 tanggungan anak-anak yang harus dibiayai sekolahnya, di antaranya saya kemudian kedua adik saya yang berada dikelas 10 smk dan kelas 2 sd. ',	'saya ingin sekali bisa berkesempatan untuk berkuliah di luar negeri untuk melanjutkan pendidikan yang sekarang sedang saya tempuh ke jenjang lebih tinggi. untuk saat ini saya lebih diusahakan lagi pada pengembangan skill-skill yang ada dalam diri, menyelesaikan tugas-tugas perkuliahan dengan semaksimal agar nilai yang didapat ketika lulus pun maksimal bagi saya. kemudian lebih tanggap dalam mencari informasi tentang beasiswa maupun kampus-kampus yang saya inginkan untuk melanjutkan kuliah nanti.',	'Kegiatan organisasi yang pernah saya ikuti merupakan menjadi staff dari SEMA difakultas saya, kegiatan yang dilakukan pada saat saya menjadi staff SEMA yaitu ikut serta dalam menjalankan proyek kerja yang sedang di berjalan pada saat itu, kebetulan proyek yang saat itu saya sempat ikuti merupakan pengembangan aplikasi SEMA yang saat itu sedang masa pengembangan dari proses sebelumnya. Aplikasi tersebut merupakan aplikasi yang terkait tentang info administrasi maupun non administrasi pada fakultas tarbiyah dan ilmu keguruan, yang berguna untuk lebih sitematis dalam penyampaian info dari pusat untuk ke jajaran badan yang berada dibawah pusat, maupun sebaliknya.',	1,	1655693998,	NULL,	0),
('SCHLR-SHFFT-7f9d85',	'USR-SHFFT-1f4b2',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655009866,	NULL,	0),
('SCHLR-SHFYH-4f8fba',	'USR-SHFYH-4f4d1',	'Shofiyah Nur Azizah ',	'2004-08-24',	'881036039684',	'Jln. Madura no. 79 Jombang ',	'S1-Ilmu Ekonomi',	'Universitas Diponegoro ',	'0.00',	'1',	'Saya adalah maba di universitas diponegoro. Semenjak di jenjang SMA saya sering mengikuti olimpiade ekonomi dan akuntansi. Saya suka dengan menghitung dan hal baru atau sebuah tantangan. Oleh karena itu saya bisa masuk di Universitas Diponegoro dengan jalur prestasi menggunakan sertifikat yang pernah saya raih. Saya juga sangat teliti dan mudah memahami serta menghafal sesuatu.',	'Mimpi terbesar setiap orang pastinya menjadi orang yang sukses dan membanggakan serta membahagiakan keluarganya. Walaupun kondisi ekonomi keluarga saya kurang baik, tapi saya akan berusaha meluluskan kuliah S1 saya dan kelak menjadi orang yang sukses agar bisa mengajak orang tua saya bangkit dari kesusahan ekonomi. Dan salah satu usaha saya adalah mencari beasiswa agar dapat menunjang kegiatan belajar saya. ',	'Iya, selama saya waktu di SMA saya sering mengikuti organisasi. Salah satunya adalah Osis sekolah dan tim Olimpiade. Disamping itu saya SMA juga dengan mondok. Jadi di pondok saya menjadi pengurus bidang pendidikan serta di kelas akhir saya menjadi ketua angkatan. ',	1,	1655178772,	NULL,	0),
('SCHLR-SHLLB-264402',	'USR-SHLLB-2a7d5',	'Shella Abniatul Ulumiah',	'2001-01-09',	'81227723399',	'JL. H. MATALI RT/RW 001/010, KEL. BINTARA JAYA, KEC. BEKASI BARAT. NO. D50, 17136',	'Fak Adab dan Humaniora Prodi B',	'UIN Syarif Hidayatullah Jakart',	'3.29',	'4',	'Saya anak pertama dari 4 bersaudara, saya typical orang yang bisa memegang tanggungjawab ketika diberikan amanah insyaallah. Apapun jabatan yang saya pegang, saya pasti taat untuk menjalani segala tugas nya, apapun resiko nya. \r\nSaya bisa mengatur waktu dengan baik, dari mengurutkan hal yang paling saya prioritaskan, sampai kepada hal-hal kecil yang saya tidak boleh tinggalkan. Bagi saya, belajar itu tidak memandang usia.\r\nSelain saya kuliah, saya tetap memperdalami ilmu agama terutama Al-Qur\'an. Karena bagaimanapun itu adalah pedoman kita. Setinggi apapun jabatan kita, jika tidak mengenal ilmu Allah, apalah daya\r\n',	'Mimpi terbesar saya yang pastinya membanggakan orangtua dengan memberikan hasil yang memuaskan dari pendidikan maupun karir yang saya jalani. Cita cita terbesar saya adalah menjadi manusia yang bermanfaat untuk manusia yang lainnya, saya ingin menjadi dosen atau tour guide yang berkualitas. Untuk mewujudkannya pastinya dengan belajar sungguh sungguh, juga tidak lupa berdo\'a kepada Allah SWT. Karena bersungguh-sungguh tanpa berdo\'a pun tidak akan bisa, apapun itu hanya titipan. Sebaliknya, jika hanya berdo\'a tanpa dengan bersungguh sungguh itu juga mustahil. \r\nBismillah saya berjuang dengan semaksimal mungkin, mencari banyak pengalaman, juga berusaha memperluas networking agar bisa mewujudkan nya sesuai dengan apa yang diharapkan.',	'Saya memiliki beberapa pengalaman organisasi. \r\nKetika Senior high school, saya mejabat sebagai pengurus bagian kebahasaan, Gabung dengan UKS penerbitan majalah (EL-AHKAM). Dan sekarang, ketika menjadi mahasiswa, saya mejabat sebagai ketua kelas dari semester 1-4, bergabung di organisasi internal yaitu UKM Bahasa-FLAT.\r\nDahulu saya juga pernah mengikuti kegiatan relawan, yaitu PMI/PMR. Pernah ikut lomba juga, yaitu lomba cerdas cermat seputar tentang ke-PMR an.',	1,	1653832121,	NULL,	0),
('SCHLR-SHNTD-251f62',	'USR-SHNTD-80a1d',	'Shinta Destyana ',	'2005-12-11',	'85764022694',	'Lampung, Indonesia ',	'IPA ',	'SMAN 1 way Jepara ',	'8.5',	'0',	'Perkenalkan nama saya Shinta Destyana, biasa dipanggil Shinta. Berdomisili di Lampung. Siswi SMA kelas 11 jurusan IPA. Di sekolah saya mengikuti ekstrakurikuler kir (karya ilmiah remaja), memiliki hobi menulis dan suka membuat desain. Selain sekolah saya juga sering membantu orang tua berkebun. Terima kasih ',	'Impian terbesar saya tentunya membuat kedua orang tua saya bangga. Dan dapat menerbitkan buku yang dapat memotivasi banyak orang. Dengan cara mematuhi perintah orang tua, mengikuti event kegiatan agar mendapatkan pengalaman dan agar mendapatkan juara, serta lain sebagainya. Terima kasih ',	'Di SMP saya mengikuti ekstrakurikuler Pramuka dan organisasi osis. Di Pramuka saya menjabat sebagai wakil ketua dan sering kali mengikuti kemah di kecamatan. Saat ini saya sedang mengikuti volunteer koma, dan masuk di bagian creative design. Terima kasih ',	1,	1655729853,	NULL,	0),
('SCHLR-SHPSH-bcb979',	'USR-SHPSH-398d3',	'Shopa Shopiatul Fitria',	'2002-05-16',	'81312072482',	'Kp.Cibeas Kel.Ciherang RT.02 RW.05 Kel.Ciherang Kec.Cibeureum Kota Tasikmalaya Jawa Barat',	'Ilmu Komunikasi',	'Universitas Swadaya Gunung Jat',	'3.06',	'4',	'seorang Mahasiswi ilmu Komunikasi yang menekuni dunia Public Speaking, diasah dengan memiliki pekerjaan sebagai MC dan speaker pada acara webinar dan sejenisnya. Memiliki hobby traveling dan diskusi.',	'Mimpi terbesarku adalah menjadi Mimpi orang lain.\r\nsaya sangat ingin menjadi orang yang sangat menginspirasi dan memotivasi bagi banyak orang di kemudian hari. tujuannya bukan terlihat lebih tinggi dari manusia pada umumnya. namun konteks nya adalah ingin membantu mereka meraih cita cita nya dengan kemampuan yang saya miliki. simpelnya, mimpi saya adalah menjadi berguna bukan sempurna.\r\ncara nya adalah : membangun empati, edukasi, aksi, kontribusi dari dini hari dengan melakukan beberapa aktivitas yang membentur karakter untuk terbentuk.',	'ya, saya memiliki sepenggal pengalaman relawan diantara nya\r\n- membantu tuna rungu untuk dapat beraksi dan berkarya, kegiatan ini berlangsung selama satu bulan (4 kali pertemuan) guna membangun kepercayaan diri pada adik yang keterbatasan. \r\n- mengadakan program donor darah, berkolaborasi bersama Siliwangi. tujuan membantu orang yang sekarat darah\r\n- Menjadi MC di setiap acara yang dilaksanakan oleh masyarakat sekitar tanpa biaya.\r\n- menjadi pengajar (anak umur 4-14) tahun mendalami pelajaran agamis\r\n- menjadi ketua Bansos setiap Ramadhan kepada panti Jompo di kecamatan Cibeureum',	1,	1655730799,	NULL,	0),
('SCHLR-SHVRM-28fe1b',	'USR-SHVRM-d6359',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655744249,	NULL,	0),
('SCHLR-SKMND-b90ddd',	'USR-SKMND-936cb',	'Sukma Indah Mawarni ',	'2002-01-15',	'82157057982',	'Jalan negara RT 5 desa petangis kecamatan batu engau Kabupaten Paser provinsi Kalimantan timur ',	'Syariah Wal Qonun ',	'Universitas Al Azhar ',	'3.00',	'2',	'Saya Sukma Indah Mawarni, akrab disapa Sukma saya lahir disalah satu desa di Kalimantan timur yaitu desa petangis. Saya adalah anak pertama dari 5 bersaudara, di jenjang dasar saya bersekolah didesa saya, sedang untuk menengah pertama dan atas saya memutuskan untuk menyesuaikan nya di salah satu pondok pesantren berbasis Modern di kota Balikpapan. Sejak duduk di bangku menengah saya sangat tertarik dengan bahasa Inggris sehingga saya mengikuti berbagai macam lomba yang di adakan di pondok seperti cerdas cermat dan juga debat. Saya sangat suka membaca buku dan buku yang sangat wajib saya baca saat itu adalah buku pelajaran, sehingga Alhamdulillah saya selalu masuk dalam 10 besar ketika Mts dan 3 besar ketika MA. Selama MA saya sudah memutuskan untuk bisa melanjutkan pendidikan di Universitas luar negeri dan semenjak itu saya mencari Informasi baik untuk yang beasiswa maupun non beasiswa hingga waktu kelulusan tiba saya memilih untuk melanjutkan pendidikan di Universitas Al Azhar Cairo Mesir. Dan Alhamdulillah semua berjalan dengan lancar. Disini saya mengambil jurusan Syariah Wal Qonun/ hukum dan perundangan undangan. besar harapan saya untuk bisa terjun lebih dalam dalam dunia hukum. Di Mesir sendiri saya mengikuti berbagai Kegiatan Organisasi baik itu dari lingkungan Mahasiswa Kalimantan ataupun dibagian yang lebih spesifik seperti Informatika Mesir sebuah organisasi Jurnalistik. Disini juga saya mengikuti berbagai kursu dan bimbingan bahasa baik itu bahasa Arab dan juga Bahasa Inggris',	'Menjadi seorang gadis desa yang berada lumayan jauh dari kota dan segala fasilitas pendidikan nya tidak menyurutkan semangat saya untuk belajar dan juga berorganisasi. Berbicara tentang mimpi maka sangat besar sangkut pautnya dengan jurusan yang sama pilih saat ini yaitu hukum yang mana di Al Azhar sendiri jurusan yang saya ambil mempelajari beberapa cabang ilmu baik itu hukum Islam, hukum Internasional dan juga hukum Nasional Mesir. Besar harapan saya agar bisa menjadi seorang yang sangat melek dengan hukum. Karna bila bica tentang hukum dinegara kita maka kita akan mendapatkan banyak sekali masalah dan Salah satu penyebab lemahnya penegakan hukum di Indonesia adalah kualitas para penegak hukum. Masih rendahnya moralitas mengakibatkan profesionalisme kurang dan terjadi ketidakmauan pada penegak hukum yang semuanya dikarenakan faktor ekonomi yang mana hukum akan tumpul kepada penjabat dan orang - orang kaya dan tajam kebawah bagi kalangan bawah. Oleh karena itu besar keinginan saya kelak nanti dapat membantu siapapun terkhusus golongan bawah yang selalu mendapat ketidak Adilan dari golongan atas. bagaimana saya menggapai mimpi saya? Saya akan belajar dengan giat, membangun relasi dan networking seluas mungkin. Mencari berbagai pengalaman dengan ikut berkontribusi dalam sebuah konferensi dan juga volunteer.',	'Semenjak SMA saya sangat menyukai belajar bahasa baik itu bahasa Indonesia sendiri hingga bahasa Asing seperti Bahasa Arab dan Inggris, sehingga ketika SMA saya menjadi pengurus bagian bahasa dan saya juga mengikuti beberapa ekstrakulikuler dalam bidang bahasa. Ketika lulus MA saya mengikuti banyak seminar dan volunteer secara online karena Corona, baik di Indonesia sendiri seperti seminar kebangsaan dengan teman \' menyangsang gagasan dan edukasi pemuda bangsa\' dalam memperingati hari pemuda yang di adakan Pemimpin.id dan bebarapa flatfom lain. dan dan juga simulasi confrensi Internasional PBB yang diadakan oleh Model United nation. Dan dimesir sendiri saya mengikuti beberapa organisasi Jurnalistik seperti Informatika yang berada dibawah naungan ICMI dan juga saya sedang mendaftar diri menjadi anggota AIESEC MESIR.',	1,	1654528018,	NULL,	0),
