('SCHLR-SKRYJ-c603db',	'USR-SKRYJ-568f1',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655744065,	NULL,	0),
('SCHLR-SLFN-53921e',	'USR-SLFN-fdd7fc',	'Sulfiani',	'2003-11-30',	'85640162978',	'Jl.Mappala 2',	'Pendidikan akuntansi',	'Universitas Negeri Makassar ',	'3.67',	'2',	'Assalamualaikum wr.wb ,om swastiyastu namo budaya dan salam kabajikan, perkenalkan nama saya Sulfiani, umur 18 tahun, anak pertama dari dua bersaudara. Saya lahir pada tanggal 30 November 2003 dan saat ini sedang menempuh pendidikan di bangku kuliah sebagai mahasiswi baru di Universitas Negeri Makassar (UNM) prodi pendidikan akuntansi.',	'Mimpi saya menjadi seseorang yang sukses di masa depan, cara mewujudkannya yaitu dengan belajar dan bersungguh sungguh dalam bidang yg ditekuni. ',	'Iya pengalaman saya dalam organisasi sekolah yaitu pmr(palang merah remaja) didalam organisasi tersebut banyak sekali manfaat yg dapat saya rasakan walaupun sebagian orang beranggapan itu hanya buang buanh waktu dan menguras tenaga tapi menurut saya ada feedback tersendiri salah satunya melatih kepemimpinan tidak heran banyak anak orhanisasi yang menjadi seprang pemimpin karna ia suda mengetahui dasar dasar dan apa saja yang seharusnya dilakukan oleh seorang pemimpin selain itu kita juga menjadi lebih disiplin, kita bisa membagi waktu. Dan masih banyak sekali hak yang didapatkan dalam suatu organisasi',	1,	1653539607,	NULL,	0),
('SCHLR-SLFRB-578be5',	'USR-SLFRB-1d575',	'Silfi Rabani',	'2002-03-09',	'89525022485',	'Kp. Bojong Pendeuy RT 03 RW 06 Desa Cangkuang Kecamatan Rancaekek',	'Prodi Perpustakaan dan Sains I',	'Universitas Padjadjaran',	'3.78',	'4',	'Saya Silfi Rabani senang sekali bertemu dengan orang baru karena dari situ saya bisa mendapatkan informasi serta wawasan baru. Saya juga memilki kemampuan berbicara di depan umum yang baik. Tak jarang, saya mengisi sebuah event sebagai master of ceremony ataupun moderator. Saya juga aktif di berbagai kegiatan kepanitiaan. Saat ini saya sedang menjadi kepala departemen Alumni dan Profesi Himaka Fikom Unpad. Dari sini saya banyak mendapatkan pelajaran baru serta berrelasi dengan alumni.',	'mimpi terbesar saya adala dapat meberangkatkan haji kedua orang tua saya. Banyak sekali halangan serta keterbatasan dalam mewujudkan mimpi ini. Untuk itu, saya bekerja keras mulai dari hal kecil untuk mewujudkan mimpi ini. Saya mengikuti berbagai pendaftaran magang ataupun beasiswa untuk membantu mengurangi beban orang tua.',	'Saya aktif di berbagai kegiatan kemahasiswaan. Salah satu kegiatan kemahasiswaan yang paling berkesan ialah menjadi panitia di divisi humas Prabu 2021. Saya mejadi LO beberapa organisasi yaitu UKM dan paguyuban, senang rasanya mendapatkan teman baru. Selain itu, saya juga menjadi LO salah satu bintang tamu yaitu 98CHAOS band. Salah satu kebanggaan dengan saya, dari situ saya memiliki koneksi dari kalangan musisi.',	1,	1655267487,	NULL,	0),
('SCHLR-SLMHR-df088d',	'USR-SLMHR-36034',	'Asila Maharani Arif',	'2002-06-02',	'85861832058',	'Dsn. Kalisari, RT 03/RW 01, Ds. Plumutan, Kec. Bancak, Kab. Semarang, Jawa Tengah',	'Pendidikan Guru Sekolah Dasar ',	'Universitas Negeri Semarang',	'3.80',	'2',	'Perkenalkan saya Asila Maharani Arif, yang biasa dipanggil dengan Asila lahir di Kabupaten Semarang, 2 Juni 2002. Saya tinggal di sebuah desa yang asri bernamadesa Plumutan yang terkenal akan kerajinan rogo-rege. Hobi saya yang rutin saya lakukan adalam membaca buku. Ayah saya bernama Arif Salasin yang bekerja sebagai fasilitator pendamping di Desa Wonosegoro, Kabupaten Boyolali. Ibu saya bernama Eny Widyawati yang berprofesi sebagai guru TK. Saya memiliki 2 adik perempuan bernama Syarifah dan Benazir. Syarifah duduk dibangku Sekolah Dasar sedangkan Benazir duduk dibangku TK. Penghasilan dari kedua orang tua saya belum mencukupi segala kebutuhan perkuliahan sebab tanggungan dari keluarga berupa kakek dan kedua adek saya. Pembiayaan kuliah saya dilakukan secara mandiri bergantung pada penghasilan orang tua.  Karena jaraj antara rumah dan kampus cukup jauh saya sekarang saya tinggal di Asrama PGSD UNNES sebab memiliki biaya sewa lebih murah ketimbang kost di sekitar kampus. Dalam Asrama juga terdapat kegiatan seperti sholat berjamaah, mengaji, tanam pohon, senam bersama yang selalu saya ikuti dengan aktif. Walaupun berjarak dengan orang tua, say tetap menyempatkan menelfon ataupun video call untuk mananyakan kabar atau sekedar mengobrol. Sejak SMA saya memiliki cita-cita ingin berkuliah.  Hal ini didorong oleh lingkungan teman-teman kami yang kuliah, pengalaman dari tetangga yang sudah berkuliah, maupun keinginan terbesar dari keluarga saya. Dukungan keluarga menjadi motivasi saya untuk mewujudkan hal tersebut. Sekarang saya menjadi mahasiswi di Universitas Negeri Semarang jurusan Pendidikan Guru Sekolah Dasar Fakultas Ilmu Pendidikan. Bidany yang saya tekuni sekarang adalah bidang pendidikan.',	'Mimpi terbesar saya adalah menjadi seorang tenaga pendidik yaitu guru sekolah dasar. Harapan saya kedepannya adalah bisa menjadi tenaga pendidik ahli untuk dapat mempersiapan peserta didik untuk dapat meningkatkan pengetahuan, keterampilan, dan sikap mereka untuk  menempuh kehidupan. Menjadikan pendidikan di Indonesia menjadi lebih baik dengan inovasi dan kreativitas pelajaran yang disesuaikan dengan kemampuan kognitif anak Sekolah Dasar. Untuk mewujudkan hal tersebut saya menempuh progran Sarjana S1 sekarang ini di Universitas Negeri Semarang. Saya juga rutin melakukan bhakti sosial dengan memberikan pelajaran tambahan pada anak-anak di sekilar asrama PGSD sebagai bentuk kepedulian maupun latihan saya untuk mengajar di masa depan. ',	'Selama kuliah saya aktif di organisasi jurusan Himpunan Mahasiswa PGSD UNNES pasa bidang departemen Pengembangan Sumber Daya Mahasiswa (PSDM). Departemen PSDM memiliki fokus untuk meningkatkan kapasistas dan kualitas SDM PGSD serta membentuk sistem kaderisasi di HIMA PGSD UNNES. Saya sebagai staff departemen PSDM pada tahun ini diberikan amanah sebagai ketua panitia pelaksanaan Ormaba (Orientasi Mahasiswa Baru) Jurusan PGSD dengan tugas merancang kegiatan, pelatihan, serta upgrading skill untuk mahasiswa baru.  Selain menjadi aktivis kampus saya juga aktif dalam organisasi Karang Taruna di desa asal yaitu Desa Plumutan. Saya sebagai ketua karang taruna memiliki tugas merencanakan kegiatan, mengkoordinir anggota, pelatihan serta upgrading anggota. Tujuan saya mengikuti organisasi adalah melatih kemampian softskill serta learship, sebagai ajang mencari pengalaman, serta ajang berbagi ilmu yang sudah didapatkan san sudah saya terapkan.',	1,	1654196636,	NULL,	0),
('SCHLR-SLMLT-e771da',	'USR-SLMLT-9858c',	'Salma Luthfiyah Assegaf',	'2002-06-30',	'81617777367',	'Limo, Depok, Jawa Barat',	'Antropologi Ilmu Sosial Ilmu P',	' Universitas Padjadjaran',	'3.36',	'4',	'Saya pribadi yang terobsesi untuk belajar banyak hal, saya juga senang sekali mengikuti organisasi yang membuat hidup saya lebih produktif dan pola pikir saya juga semakin berkembang. Salah satu kelebihan saya adalah kemampuan mengatur waktu. Saya mengorganisir waktu yang saya miliki semaksimal mungkin dengan adanya jadwal-jadwal rutin yang saya susun, biasanya saya membuat schedule atau notes untuk kegiatan-kegiatan yang akan saya lakukan, baik itu schedule harian, mingguan, dan bulanan. Mungkin sampai membuat alarm untuk memberi peringatan untuk detail waktunya dalam mengerjakan beberapa kegiatan. Saya juga pribadi yang memiliki rasa tanggung jawab, visioner, mudah bergaul dengan orang baru, dan memiliki tekad yang kuat. Salah satu kekurangan yang saya miliki adalah saya terkadang mudah lupa, membuat jadwal atau reminder di handphone merupakan alternatif yang saya lakukan di samping membuat schedule memang kelebihan atau kesenangan bagi saya pribadi dan ini juga memberikan solusi atas kekurangan yang saya miliki. ',	'Mimpi terbesar saya adalah saya ingin menjadi business woman atau pengusaha yang sangat sukses di Indonesia, bahkan di dunia. Saya ingin membuka banyak lapangan pekerjaan untuk membantu banyak keluarga, hal ini juga sekaligus mengurangi angka pengangguran di negara kita. Hal yang saya lakukan adalah saya berusaha maksimal untuk memperbanyak wawasan dalam berbagai aspek, terutama dalam bidang ekonomi dan juga memperluas relasi dengan mengikuti berbagai kegiatan, organisasi, dan lain-lain yang membantu diri saya menjadi semakin berkembang dan bervalue. Dari kecil, saya juga sudah pernah memiliki usaha yang memang saya sendiri yang mengelolanya langsung. Saya senang jika orang lain merasakan manfaat dari hal yang saya tawarkan.',	'Iya, saya memiliki pegalaman organisasi maupun volunteer. Saya memang menyukai kegiatan tersebut. Sampai-sampai dari SD saya juga sudah mengikuti organisasi dan menyibukkan diri di berbagai kegiatan yang positif. Saat ini, saya juga sedang mengikuti organisasi di kampus dan juga di luar kampus. Tidak hanya organisasi, saya juga memiliki beberapa pengalaman mengikuti volunteer dan juga internship. Hal yang suka dengan kegiatan tersebut adalah saya semakin hari semakin menjadi pribadi yang lebih baik dan memiliki keterbukaan dalam berpikir. Saya senang berinteraksi dengan banyak orang dan saling menebar manfaat di lingkungan sekitar. ',	1,	1655744965,	NULL,	0),
('SCHLR-SLMNB-ecb324',	'USR-SLMNB-e3424',	'Salma Nabi\'uz Zahdia',	'2003-05-14',	'81267100424',	'RT 02/RW 11, Dsn. Bendo, Ds. Tempuran, Kec. Paron, Kab. Ngawi, Prov. Jawa Timur',	'Sejarah Peradaban Islam/ Adab ',	'UIN Sunan Ampel Surabaya',	'3.72',	'2',	'Saya adalah orang yang suka mencatat. Saya suka berinteraksi dan mencoba hal-hal baru. Kelemahan Saya adalah Saya sering lupa, namun dengan kelebihan Saya yang suka mencatat itu membuat Saya bisa mengingat hal yang Saya lupakan. ',	'Impian Saya adalah ingin menjadi orang yang bermanfaat bagi orang lain. Saya juga ingin meneruskan kuliah S2 di luar negeri dengan beasiswa dan bekerja di sana sebagai seorang sejarahwan islam. ',	'Saya memiliki beberapa pengalaman organisasi. Dari MI Saya sudah mengikuti organisasi kepramukaan dan mengikuti lomba seperti qiroah dan olahraga catur. Lomba itu saya lanjutkan di MTs/SMP serta mengikuti OSIS yang pada saat itu menjadi bendahara dan organisasi kepramukaan tingkat Penggalang. Organisasi kepramukaan itu saya lanjutkan di MAN/SMA yang akhirnya saya resmi menjadi pramuka Penegak garuda. Saya juga mengikuti festival albanjari dan lomba itu sering kami menangkan dari tingkat kota sampai provinsi. Saat libur semester, saya juga mengikuti volunteer yang diadakan oleh Senyum Anak Nusantara yang pada waktu itu dilaksanakan bulan Agustus 2021. Dan saat ini, saya resmi menjabat menjadi pengurus SAN chapter Surabaya menjadi Divisi Danus. Saya juga menjadi pengurus Forum Mahasiswa Ngawi sebagai Departemen Media dan Informasi. Di kampus, saya juga mengikuti UKM IQMA atau ikatan qori qoriah mahasiswa yang dilaksanakan rutin setiap minggunya. ',	1,	1654926975,	NULL,	0),
('SCHLR-SLSBL-618e2c',	'USR-SLSBL-248ee',	'Salsabila Qonita Kaltsum',	'2004-01-27',	'83836851941',	'Jalan karebet I, Ngepos Tingkir Nomor 2, RT 02/ RW 08, Kelurahan Tingkir Tengah, Kecamatan Tingkir, Kota Salatiga. 50745.',	'Statistika/Fakultas Sains dan ',	'Universitas Diponegoro',	'0.00',	'1',	'Bismillahirrahmanirrahim. Assalamualaikum warahmatullahi Wabarakatuh.\r\nNama saya Salsabila Qonita Kaltsum, bisa dipanggil Salsa. Saya adalah Mahasiswi baru dari Universitas Diponegoro Semarang, Jawa Tengah. Selain sekolah, saya suka membantu orang tua mengelola usaha kecil-kecilan.\r\nSelama di SMA, Alhamdulillah saya berhasil memenangkan beberapa kompetisi matematika tingkat nasional dan saya juga aktif dalam Organisasi KIR.\r\n\r\nSaya memiliki minat yang sangat besar pada Ilmu Statistika dan saya berkeinginan sangat kuat untuk meraih cita-cita saya sebagai ahli statistik sehingga saya memilih berkuliah di jurusan statistika di universitas Diponegoro.',	'Mimpi terbesar saya adalah saya ingin sukses.\r\n\"SUKSES\" \r\nSukses menurut saya adalah sesuatu yang bisa saya lakukan dan itu bisa berguna untuk orang lain walaupun orang lain itu orang terdekat kita.\r\nSaya selalu bermimpi kelak jika saya lulus kuliah nanti dan telah bekerja, sebagian gaji akan saya tabung. Jika sudah terkumpul saya ingin mendirikan sebuah Masjid agar orang-orang bisa beribadah. Saya ingin mendirikan sebuah kos-kosan. Lumayan untuk menambah pemasukan. Saya juga ingin membahagiakan kedua orangtua dengan hasil kerja keras saya. Mungkin inilah kesuksesan terbesar dalam hidup saya.\r\nMulai dari sekarang saya akan terus berusaha agar semua mimpi-mimpi saya dapat tercapai dan terlaksana. Dan akan lebih baik lagi jika kelak banyak yang bisa saya lakukan untuk dapat membuat bangga dan berguna untuk banyak orang. Maka dari itu kesuksesan itu bukan dicari tetapi kita yang ciptakan sendiri.\r\nCara mewujudkannya adalah dengan terus melakukan evaluasi strategi dan kemajuan yang telah didapatkan. Mungkin saja, saya perlu menyesuaikan sasaran, membutuhkan tujuan yang berbeda, atau lain sebagainya.',	'Saya punya pengalaman mengikuti kegiatan sekolah. Saat di SMA saya mengikuti kegiatan KIR. \r\nIkut kegiatan KIR sangat mengasah kemampuan menulis kita. \r\nSelain itu saya juga belajar bagaimana cara bekerja dalam tim saat mengikuti lomba penelitian dengan teman-teman. Saya belajar membuat kesepakatan dan konsekuensi secara bersama, berdiskusi secara intensif, membagi tugas dan waktu juga..\r\nSelain itu juga bisa mengasah skill komunikasi di dalam kegiatan KIR. Kenapa? Karena di dalam kegiatan KIR kita sering disuruh menungkapkan pendapat kita untuk berbagi ide dan sharing-sharing tentang ilmu yang kita punya.',	1,	1654401684,	NULL,	0),
('SCHLR-SLSBL-89e137',	'USR-SLSBL-7533c',	'Salsabila Anjani Putri',	'2003-12-13',	'83131985961',	'Jl. Kadir TKR, Kec. Gandus, Palembang',	'Ilmu Keperawatan/Fakultas Kedo',	'Universitas Sriwijaya',	'3.88',	'2',	'Saya seorang yang observant, hal ini membuat saya cenderunf terlihat seperti orang yang pendiam dan suka melamun. Padahal, saya suka sekali memperhatikan hal-hal kecil yang meliputi jalannya sesuatu. Saya menyukai teka-teki dan pola yang tertata, dimana di sana terdapat ruang bagi saya untuk mengeksplorasi suatu hal sembari mengikuti alur peristiwa. Selain suka memperhatikan, saya juga orang yang well-planed. Sebelum melakukan sesuatu, saya seringkali menghabiskan waktu yang lama untuk mempelajari dan mengorek-orek suatu hal hingga ke akarnya. Akibatnya, hal ini membuat saya tampak seperti orang yabg lamban namun perfeksionis. Saya juga orang yang melankolis dan cukup emosional, hal ini menyebabkan saya seringkali merasa cepat lelah saat berada pada lingkungan yang ramai. Namun, saya dikenal orang yang talkative atau suka bercerita oleh orang-orang di sekitar saya.',	'Mimpi terbesar saya adalah membantu menyelamatkan dan mengobati orang lain. Sejak dulu, saya sering sekali diajak ayah ke rumah sakit untuk menemaninya check up. Dan saat ini, saat ayah saya telah tiada, saya sadar sekaligus merasa tertarik dengan hal-hal yang berbau kesehatan. Dalam mewujudkannya, sekarang saya tengah menempuh pendidikan di program studi Ilmu Keperawatan. Kedepannya, saya berharap saya dapat lulus tepat waktu dengan nilai yang memuaskan, bekerja pada instansi kesehatan dan akhirnya dapat menolong banyak orang.',	'Ketika SMA, saya mengikuti organisasi kerohanian Islam. Di sana saya masuk ke divisi hadroh dan tilawah. Saat ada festival atau acara Islam pun saya juga terlibat menjadi panitia didalamnya. Di sana, saya belajar tentang kerjasama dan motivasi antar sesama. Saya belajar bahwa suatu projek tidak akan berjalan lancar tanpa adanya kerjasama dan solidaritas tim yang baik. Di tengah masa pandemi, saya juga aktif dalam mengikuti virtual campaign/volunteer. Disana saya juga belajar bagaimana cara mempromosikan suatu event melalui sosial media, juga tak lupa kerja sama antar anggota tim.',	1,	1653891515,	NULL,	0),
('SCHLR-SLSFT-97943e',	'USR-SLSFT-a8bcb',	'Salsa Fatrisia',	'2003-01-16',	'81328020611',	'Gondosari 4/4, Kec. Gebog, Kabupaten Kudus, Jawa Tengah',	'Pendidikan Bahasa Inggris/Faku',	'Universitas Muria Kudus',	'3.91',	'2',	'Nama saya Salsa Fatrisia, usia saya 19 tahun. Saya memiliki minat yang besar dalam bidang pendidikan. Saya berasal dari daerah kecil di bagian utara Pulau Jawa dengan fasilitas pendidikan yang sudah memadai di beberapa daerah sekitar. Berdasarkan pada ketertarikan saya dalam bidang pendidikan, saya memutuskan untuk mengambil jurusan Pendidikan Bahasa Inggris dan saat ini saya sedang menempuh semester 2 di Universitas Muria Kudus.',	'Saya bercita-cita untuk membangun kelompok belajar atau forum diskusi bersama dengan anak-anak yang memiliki kesulitan dalam mendapatkan pembelajaran pendidikan. Saya berharap melalui cita-cita tersebut dapat menjadikan saya sebagai salah satu kandidat dalam penerimaan beasiswa ini, karena saya ingin membantu mengembangkan sumber daya manusia yang berkualitas dengan karakter yang unggul di masa depan.',	'Saat ini saya mengikuti salah satu organisasi Himpunan Mahasiswa yang memiliki fokus dalam mengembangkan generasi yang unggul serta membantu pengembangan pembelajaran dalam aksi sosial.',	1,	1653669905,	NULL,	0),
('SCHLR-SLSYN-8f5987',	'USR-SLSYN-ad29e',	'Salsya Novita Ramadhani',	'2001-11-24',	'83895659556',	'Prawirodirjan GM 2 rt 58 rw 18 Gondomanan Yogyakarta',	'Ilmu komunikasi ',	'Universitas Muhammadiyah Yogya',	'2.28',	'4',	'Hallo I am Salsya Novita Ramadhani, I am a student majoring in S1 ilmu komunikasi at University Muhammadiyah Yogyakarta. The reason why I got this scholarship because to get new experience, new relation, improve myself, and get new knowledge.',	'Mimpi terbesar saya adalah dapat mengunjungi berbagai negera di dunia. Cara mewujudkannya tentu dengan usaha yang maksimal seperti terus belajar hal-hal baru, tidak takut untuk gagal, terus mencoba, serta diiringi doa kedua orangtua',	'Saat ini saya mengikuti organisasi di lingkungan kampus yaitu (1)fresh club, saya menjabat sebagai anggota divisi media. Saya diberikan tanggung jawab untuk mengelola akun sosial media(Instagram fresh club). Hasil yang saya berikan berupa memastikan akun yang saya pegang selalu aktif dan memberikan informasi up to date sehingga dapat bermanfaat bagi semua orang. (2) Volunteer Brand Daisy Organic, saya termasuk anggota yang aktif mempromosikan produk\" baik itu secara langsung ataupun tidak langsung serta memberikan citra yang baik terhadap brand hingga saat ini.',	1,	1655744743,	NULL,	0),
('SCHLR-SLTHN-ad6426',	'USR-SLTHN-faa42',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655743670,	NULL,	0),
('SCHLR-SLVNR-cea38d',	'USR-SLVNR-ea252',	'Selvina Ariyanti',	'2002-01-04',	'88225090452',	'Jalan M.Yamin No.112, Panularan, Kecamatan Laweyan, Surakarta',	'Fisika',	'Universitas Sebelas Maret',	'3.51',	'4',	'Saya Selvina Ariyanti terlahir di Wonosobo pada Jumat 4 Januari 2002. Saya \r\nmerupakan mahasiswa semester 4 yang berasal dari keluarga sederhana, tapi memiliki tekad yang kuat dalam mencapai masa depan yang gemilang. Saya berasal dari program studi S1 Fisika Fakultas Matematika dan Ilmu Pengetahuan Alam (FMIPA) Universitas Sebelas Maret. Saat ini saya memiliki kesibukan dalam menghafal Al-Quran, berkarya melalui kepenulisan ilmiah, mengikuti seminar atau webinar kepenulisan, berorganisasi, kepanitiaan kegiatan, dan melatih skill dalam berbahasa inggris baik secara aktif maupun pasif.',	'Salah satu impian saya yaitu menjadi seorang peneliti di Lembaga Ilmu Pengetahuan Indonesia (LIPI) atau Badan Tenaga Nuklir Nasional (BATAN) serta menjadi seorang fisikawan medis khususnya dalam bidang radioterapi dan radiodiagnostik. Seiring dengan berkembangnya teknologi, ilmu radiasi dan nuklir ternyata bisa digunakan sebagai pendiagnosisan dan terapi atau pengobatan, tetapi ahli fisika medis yang berkompeten di Indonesia masih kurang. Selain itu, \r\nfisikawan medis juga berpotensi dalam mengoptimalkan manfaat dari paparan radiasi \r\nsekaligus meminimalisir risiko radiasinya. Banyaknya jumlah rumah sakit dan klinik di Indonesia dan masih rendahnya tenaga yang ada, maka beberapa tahun ke depan fisikawan medis ini masih dibutuhkan di Indonesia. Selanjutnya, fisikawan medis juga turut berpartisipasi dalam investigasi dan evaluasi kecelakaan radiasi, meningkatkan kemampuan sesuai perkembangan IPTEK (Ilmu Pengetahuan dan Teknologi) serta menjadi Petugas Proteksi Radiasi (PPR). Seiring berkembangnya teknologi kesehatan yang secara langsung juga berpengaruh pada industri kesehatan, maka fisikawan medis dapat berperan di lembaga penelitian dan pengembangan untuk membantu Indonesia dalam menghadapi era society 5.0.\r\nCara saya untuk bisa mewujudkannya adalah utamanya dengan meminta doa orang tua, istiqomah (kontinu) dalam berusaha, dan pantang menyerah. Selain itu juga menjalin relasi agar bisa lebih banyak mendapatkan informasi\r\n',	'Selain itu, organisasi pun menjadi hal yang tidak bisa terlepas semenjak saya duduk dibangku madrasah tsanawiyah. Beberapa organisasi yang saya ikuti saat ini sepertikamadiksi wonosobo yang merupakan organisasi dalam bidang pendidikan di wonosobo. Organisasi dalam kampus yang saya ikuti, seperti IQ (Ilmu Quran) yang bergerak dalam bidang ilmu-ilmu Quran dan pembentukan mahasiswa muslim yang berkualitas untuk membentengi diri dari pengaruh negatif pada zaman modern ini, serta mengikuti SIM (Studi Ilmiah Mahasiswa) yang berfokus dalam bidang keilmiahan tingkat universitas.\r\nDari beberapa organisasi yang diikuti tersebut, maka saya memiliki pengalaman \r\ndalam mengikuti kepanitiaan, misalnya dalam lingkup wilayah seperti WEF (Wonosobo Educational Forum) dalam bentuk lomba esai mengenai problem solving bagaimana kondisi mental dan pendidikan anak-anak di wonosobo yang dilakukan secara daring selama pandemi serta acara Hiperion atau hidupakan pendidikan remaja Wonosobo yang berfokus pada motivasi kuliah, sosialisasi dan pemdampingan mengenai beasiswa KIP-K (Kartu Indonesia Pintar Kuliah). Sedangkan beberapa kepanitiaan yang dilakukan di dalam kampus, seperti serangkaian acara Fisika yaitu Dies Natalis Fisika dan Musyawarah Besar Fisika. Selain itu, juga mengikuti kepanitiaan Qur’anic Research yang mengadakan penelitian tindak lanjut dari Bapak Sutanto mengenai “Cryptanalysis of Vigenere Cipher Algorithm for Arabic Language” dengan metode Index of Coincidence pada halaman Quran dan dipresentasikan hasilnya pada salah satu kegiatan seminar UNS.\r\n',	1,	1654370318,	NULL,	0),
('SCHLR-SLVRH-3f5939',	'USR-SLVRH-1abb2',	'Selvi Rahma Gusni',	'2004-08-10',	'83181826595',	'SUMATERA BARAT,KOTA PADANG, NUANSA INDAH -TARUKO RODI , KELURAHAN  LIMAU MANIS SELATAN , KECAMATAN PAUH .RT 03/RW 04,KODE POS 25164',	'IPA',	'SMAN 14 PADANG',	'3.98',	'4',	'Sebenarnya saya merupakan seorang murid yang sangat pemalu dan takut akan berbicara didepan umum, walaupun begitu saya tak peduli akan pendapat teman-teman saya yang lain saya ingin berhasil di bidang yang lain .\r\nSaya menyukai mata pelajaran seni dan bahasa Inggris , tetapi saya belum terlalu bisa berbahasa Inggris.Di kelas saya adalah orang yang sangat ambisius saya selalu duduk paling depan dan tak pernah sekalipun absen ,walau hujan dan demam saya tetap akan berangkat sekolah ,karna tekad dan semangat yang saya miliki.',	'Mimpi terbesar saya sedari kecil adalah ingin membahagiakan kedua orang tua saya,dan saya bertekad ingin memberangkatkan orang tua saya ketanah suci suatu  saat nanti. Dengan cara saya harus belajar dengan bersungguh-sungguh dengan tekad dan semangat untuk memperoleh prestasi yang terbaik.',	'Tidak,karena saya lemah dalam hal bersosialisasi dan juga berbicara didepan umum',	1,	1654951804,	NULL,	0),
('SCHLR-SLWSL-dd78a2',	'USR-SLWSL-cbacc',	'Salwa Salsabila',	'2003-03-03',	'83161816267',	'Jl Jakabaring Lrg Harapan RT 23 RW 06\r\nKec Jakabaring Kel Seberang Ulu 1 Kota Palembang,Sumatera selatan.',	'Prodi Ekonomi Syariah Fakultas',	'Universitas Islam Negeri Raden',	'3.53',	'2',	'Saya adalah anak ke-2 dari 5 bersaudara yang dimana menjadi tumpuan harapan orang tua setelah kakak saya. Saya merupakan rekan Ibu saya berdagang. Saya menyukai hal hal yang berbau bisnis dan sangat suka dengan musik.',	'Saya ingin membesarkan usaha ibu saya yang sudah lama ia rintis. Usaha ibu saya bergerak pada bidang makanan yaitu Pempek. Mimpi saya adalah bisa membangun sebuah toko dan berkontribusi langsung dalam merencanakan,mengelola,dan mengatur keuangan yang ada. Saya harap nama produk ibu saya dikenal banyak orang layaknya pempek-pempek terkenal saat ini. Cara untuk mewujudkannnya adalah dengan mencari pengalaman dan pencapaian yang banyak sejak dini. Dengan kemampuan yang saya punya, harapannya saya akan bisa apply ke perusahaan-perusahaan ternama. Dan dengan gaji yang didapat lah saya akan merakit mimpi saya sedikit demi sedikit.',	'1. Anggota relawan Layar Hati Palembang.\r\n   -Terpilih menjadi divisi acara Layar Hati pada 5 Desember 2021.\r\n\r\n2. Anggota Lembaga Akuntasi dan Bisnis Syariah UIN RAFA Palembang.\r\n    -Berpatisipasi dalam acara: MUBES,SIKRAB,dan Dialog Kewirausahaan.\r\n\r\n3. Anggota pemuda-pemudi dikampung halaman rumah.\r\n    - Menjadi panitia pada acara 17 Agustus setiap tahunnya\r\n\r\n4. Juara 1 pada acara lomba Business Plan di Opi Mall Pada 13 Maret 2022\r\n\r\n5. Berpatisipasi dalam acara TV yaitu Kompas TV “Kuah kaya rempah dan udang dalam mangkok pindang”\r\n\r\n6. Anggota Himpunan Mahasiswa Program Studi Ekonomi Syariah.\r\n\r\n\r\n\r\n',	1,	1654680570,	NULL,	0),
('SCHLR-SMDN-66964a',	'USR-SMDN-402fb0',	'ismu diana',	'2002-04-08',	'81586429534',	'jl tanah seratus 05/01 sudimara jaya, ciledug, kota tangerang',	'manajemen sumber daya manusia',	'politeknik STIA LAN jakarta',	'3.71',	'2',	'saya merupakan seorang mahasiswi di perguruan tinggi vokasi di Jakarta. saya merupakan seorang yg berambisi tinggi dalam mencapai suatu tujuan/keinginan.',	'saya ingin menjadi pengusaha sukses. upaya yg saya lakukan saat ini yaitu dgn membantu mengelola small bussiness orang tua dan mengikuti organisasi yg berkaitan dgn dunia usaha di kampus. upaya yg dilakukan untuk kedepannya yaitu dgn saya memiliki pengetahuan dan kemampuan lebih saya akan mengembangkan small bussiness tsb.',	'iya, saya mengikuti beberapa organisasi dikampus dan menjadi pengurus di salah satu organisasi tsb.',	1,	1655709120,	NULL,	0),
('SCHLR-SNBLN-c62ec3',	'USR-SNBLN-b7f3d',	'Esa Nabila Nova Evi Talia',	'2003-02-01',	'81215524978',	'Desa growong lor rt 3 rw 3 juwana pati jawa tengah',	'Antropologi sosial',	'Universitas diponegoro',	'3.71',	'4',	'Saya anak yatim yang ditinggal ayah saya sejak saya smp .Saya tinggal bersama ibu saya ibu saya bekerja sebagai pembantu rumah tangga dan saya bekerja sebagai pengajar les ngaji di rumah dengan gaji seiklhasnya tentu tidak cukup untuk memenuhi kebutuhan. Sering dihina tidak mampu kuliah dan juga tidak mampu makan.',	'Mimpi terbesar saya ingin menjadi pejabat negara saya ikut organisasi seperti ampd demokrat juwana',	'Ya,saya gabung organisasi angkatan muda penggerak demokrat yang di dalamnya diberi dana dari kepala untuk membantu masyarakat yang membutuhkan',	1,	1654412321,	NULL,	0),
('SCHLR-SNGGH-1e6b6f',	'USR-SNGGH-05b9d',	'Singgih Pratama',	'2003-01-15',	'81523763518',	'Kp. Cimaranggi rt 03 rw 01 kecamatan Majalaya kabupaten Bandung, Jawa Barat',	'Akuntansi, Fakultas Ekonomi da',	'Universitas Sultan Ageng Tirta',	'3.69',	'1',	'Saya Singgih Pratama, saya terlahir dari keluarga yang terbilang serba pas pasan. Saya anak pertama dari dua bersaudara adik saya sudah menginjak kelas 11 tahun ini, kesulitan pembagian biaya pendidikan adik saya dan saya membuat saya harus mencari beasiswa. Saya tidak terlalu pintar dan ambisius seperti teman teman saya yang lain, tapi saya memiliki banyak keingintahuan walau saya hanya mencari dari sumber internet saja. Saya lebih suka menghitung mengenai perekonomian dibanding matematika, karena saya bercita cita untuk menjadi anggota komisioner OJK.',	'Saya ingin mengubah hidup saya dengan mempunyai banyak teman, saya dengan sifat introvert yang bisa dibilang tidak mempunyai teman yang benar benar teman. Oleh karena itu di jenjang Universitas ini saya mulai berubah saya perlahan berubah dan melepas sifat introvert pada diri saya namun itu semua masih membutuhkan waktu',	'Saat masih di jenjang sekolah menengah saya pernah menjadi anggota OSIS (SMP), pramuka (SMP), MPK (SMK), paskibra(SMK). Pengalaman organisasi saya mungkin hanya sedikit tetapi saya belajar banyak hal bagaimana caranya disiplin waktu, bicara didepan umum, menjadi dewan pada sidang pertanggungjawaban itu benar benar membuat diri saya lebih berpikir lagi untuk tidak berlindung dari kata MALU baik Malu berbicara ataupun malu bertindak.',	1,	1655691544,	NULL,	0),
('SCHLR-SNGRH-5ada2f',	'USR-SNGRH-dca6f',	'Sinaga, Rahel Gracia',	'2004-11-08',	'81375192650',	'Jl. Jawa No. 35, Bantan, Siantar Barat, Pematang Siantar, Sumatera Utara',	'Teknik geofisika',	'UPN Veteran Yogyakarta',	'0.00',	'0',	'Saya baru tamat SMA dan sekarang hendak menempuh kuliah s1 saya. Kelebihan saya terletak pada keberanian  mengungkapkan pendapat saya. Saya melihat diri saya juga mampu berkomunikasi dengan baik, percaya diri serta dapat mendengarkan orang lain dengan baik. Saya memiliki minat yang tinggi dalam hal berkomunikasi dengan orang lain seperti mengungkapkan pendapat saya dan mendengarkan pendapat orang lain. Saya juga memiliki minat yang tinggi dalam hal editing baik foto maupun video dan yang terakhir saya juga memiliki minat dalam hal bernyanyi. Menurut saya, hal yang membanggakan yang ada pada diri saya adalah saya selalu dicari orang lain dalam menceritakan keluh kesah masalah mereka, dan mereka sangat membutuhkan saran dan opini dari saya. Dalam hal kerja kelompok sekolah saya juga dibutuhkan dalam memutuskan jawaban dalam pekerjaan sekolah tersebut.',	'Mimpi terbesar versi saya adalah tentang negara kita Indonesia ini supaya masyarakat dapat lebih cerdas menanggapi segala informasi-informasi tanpa langsung menyimpulkan info-info tersebut dengan pola pikir yang salah. Jadi cara yg akan saya lakukan untuk mewujudkannya adalah membentuk komunitas yang dapat mengedukasi semua masyarakat dengan cara melakukan penyuluhan baik secara tatap muka kepada masyarakat, datang ke sekolah-sekolah sekitar untuk membangun pola pikir yang baik dalam menanggapi informasi-informasi, memposting postingan di platform media sosial yang mengedukasi tentang \'jangan mudah termakan hoax,  dan lain sebagainya yang sekiranya semua masyarakat di Indonesia ini  akan jadi lebih cerdas dalam menanggapi segala informasi.',	'Sewaktu SMP saya mengikuti organisasi pramuka dan di SMA saya mengikuti organisasi English Club.',	1,	1653989901,	NULL,	0),
('SCHLR-SNNDS-c347b1',	'USR-SNNDS-4ac84',	'Esa Nanda Salsabila',	'2000-08-10',	'87733772241',	'Karaban RT 2 RW2, Gabus, Pati',	'Pendidikan Teknik Informatika ',	'Universitas Muhammadiyah Surak',	'3.35',	'4',	'Perkenalkan nama saya Esa Nanda Salsabila yang akrab dipanggil Sasa. Saya lahir di Pati, 10 Agustus 2000. Saat ini saya merupakan mahasiswa semester 4 di Program Studi Pendidikan Teknik Informatika, Universitas Muhammadiyah Surakarta. Saya merupakan seorang yanhg  pembelajar, mudah bersosialisasi dan pantang menyerah. Saya suka bertemu dengan banyak orang dan mengambil pelajaran dari setiap orang yang saya temui. Maka saya sangat menghargai waktu dan mengoptimalkan sebaik-baiknya agar menjadi bermanfaat. Selain itu, saya sangat suka membantu orang lain dengan kemampuan yang saya miliki. Karena bagi saya, sebaik-baik manusia yakni yang bermanfaat bagi manusia lainnya. ',	'Impian saya dekat ini adalah saya ingin menjadi front-end developer dan designer UI/UX, maka itu saya rajin dan sangat antusias mengikuti berbagai pelatihan yang relevan dan membangun portofolio saya. Dari pengalaman tersebut, cita-cita saya selanjutnya yakni saya ingin bergerak menjadi pendidik yang mengutamakan moralitas dari peserta didik. Saya berusaha mencari pengalaman sebanyak mungkin dan mengambil setiap hikmah perjalanan hidup saya untuk saya bagikan kepada mereka nanti. Tujuan saya adalah memotivasi sekaligus memberikan mereka dorongan agar senantiasa melakukan hal yang positif. ',	'Saya merupakan seorang yang suka bersosialisasi sehingga saya turut aktif pada kegiatan organisasi. Sejak duduk di bangku SMA saya sudah menjabat sebagai Andalan Koordinator Pramuka Urusan Kesekretariatan pada 2019. Setelah masuk universitas, saya mengikuti Unit Kegiatan Mahsiswa yakni Lembaga Pers Mahasiswa (LPM) Pabelan sejak awal semester. Saya diamanahi menjadi staff IT dan Publikasi pada tahun 2020 dan menjadi Staff personalia pada tahun 2022. Pada LPM Pabelan saya juga ikut serta dalam hal layouting koran dan pembuatan beberapa pamflet kegiatan. Bersamaan dengan itu saya juga ikut serta dalam Himpunan Mahasiswa Program Studi (HMP) Pendidikan Tenkik Informatika yang diamanahi di bidang keislaman. ',	1,	1653901488,	NULL,	0),
('SCHLR-SNRHM-40feef',	'USR-SNRHM-70be2',	'Sania Rahmawati',	'2002-07-11',	'85743322086',	'Wojo RT 05 No 149 Bangunharjo, Sewon, Bantul',	'Teknologi Pangan dan Hasil Per',	'Universitas Gadjah Mada',	'3.76',	'4',	'Saya Sania Rahmawati, mahasiswi Teknologi Pangan dan Hasil Pertanian Universitas Gadjah Mada angkatan 2020. Asal saya dari Jogja. Saya memiliki ketertarikan dalam bidang pangan, kesehatan, pendidikan, dan lingkungan. Dalam menjalani kuliah jurusan saya tersebut, saya mempelajari banyak hal dari cara pengolahan suatu produk dari bahan mentah hingga menjadi produk siap dipasarkan. Dari situ, saya juga mendapatkan ilmu mengenai mikrobia dan cara pengendaliannya. Tidak hanya semata-mata berkuliah, saya bersama tim mencoba untuk mengikuti lomba business plan dalam menciptakan produk pangan baru hingga dilakukan pemasaran. Hasil dari lomba tersebut kami berhasil menjadi juara. Kemudian, saya dan tim juga pernah mengikuti Lomba Karya Tulis dan terpilih menjadi peraih penghargaan khusus. Dalam bidang individu, saya juga memiliki ketertarikan dalm dunia desain grafis dan saya pernah mendapatkan juara 1 dalam perlombaan infografis di tingkat nasional. Di waktu senggang terkadang saya gunakan untuk mencari informasi-informasi penting dan positif untuk menambah insight baru. Saya juga senang belajar hal baru, bekerjasama dengan tim, dan mudah beradaptasi. Selain itu, saya dapat dikatakan sebagai seorang yang rajin dan teliti dalam mengerjakan suatu hal. Saya yakin dengan beasiswa ini beserta program-program yang disajikan dapat menjadi wadah bagi saya untuk mengasah softskill dan mendapatkan insight baru dalam membekali hal kedepannya bagi saya.',	'Saya memiliki impian utama untuk dapat membahagiakan dan mewujudkan keinginan orang tua serta dapat membantu orang-orang yang membutuhkan. Dalam mencapai hal tersebut langkah saya yaitu dapat diberi kesempatan untuk berkuliah di salah satu universitas favorit yaitu di UGM. Hal ini menjadi suatu awalan bagi saya untuk mendapatkan bekal dalam meraih satu persatu impian saya. Dalam proses menjalani perkuliahan tersebut saya berusaha untuk menjalaninya dengan sungguh-sungguh dengan harapan mampu mendapatkan bekal ilmu dan nilai IPK yang baik yang nantinya berguna untuk mencari pekerjaan. Disamping menjalani bidang akademis, saya juga mengikuti berbagai organisasi dan kegiatan-kegiatan di kampus maupun di luar kampus untuk mengembangkan potensi softskill yang tidak bisa didapatkan dalam pembelajaran kuliah dengan dosen serta menambah koneksi dengan orang lain. Hal itu semua dapat sangat berguna bagi bekal saya kedepannya. Impian saya setelah lulus sarjana yaitu dapat bekerja di salah satu industri pangan untuk menjadi seorang Quality Control dan apabila terdapat kesempatan lain dapat mendaftar menjadi PNS di lingkup pangan maupun pertanian. Selain itu saya juga ingin memiliki suatu usaha sampingan yang dapat menjadi pemasukan tambahan. ',	'Disamping mengikuti pembelajaran kuliah (akademis) saya juga tentunya mengikuti berbagai kegiatan organisasi. Diantaranya yaitu menjadi salah satu anggota di Himpunan Prodi saya yaitu KMTPHP UGM. Disitu saya mendapatkan pengalaman menjadi public relation yang bertugas menghubungi pihak-pihak terkait dalam berjalannya suatu event, mencoba dalam melakukan pengembangan produk untuk suatu desa binaan, dan menjadi designer grafis suatu event. Kemudian saya mengikuti UKM Panahan di tingkat universitas yang menjabat sebagai public relation dan dalam event universitas juga menjadi bagian publikasi yang mana tugasnya juga menghubungi pihak-pihak terkait dan dalam pengelolaan suatu media sosial. Selanjutnya dalam organisasi study club tingkat fakultas saya menjabat sebagai bendahara umum yang bertugas mengelola dan mengatur pengeluaran maupun pemasukan anggaran untuk berlangsungnya program-program kerja. Selain mengikuti organisasi di kampus saya memiliki pekerjaan sampingan yaitu mengajar private anak SD. Di kampung, saya pernah menjadi pengajar Taman Pendidikan Alquran untuk anak-anak. Dengan mengikuti kegiatan-kegiatan tersebut saya dapat meningkatkan softskill dan koneksi dalam menyiapkan dunia kerja nantinya.',	1,	1654413246,	NULL,	0),
('SCHLR-SPTRH-4368f0',	'USR-SPTRH-e4cf9',	'Sapitri Halimatus Sadiah',	'2001-04-24',	'85659050914',	'Kp. Negla Desa. Cipangramatan Kec. Cikajanh Kab. Garut 44171 Jawa Barat',	'Manajemen/Ekonomi dan Bisnis',	'UNIVERSITAS MUHAMMADIYAH BANDU',	'3.9',	'2',	'Saya seorang mahasiswi tahun kedua di Universitas Muhammadiyah Bandung, Fakultas Ekonomi dan Bisnis. Sebagai jurusan Manajemen, saya ingin menggunakan pengetahuan saya dengan baik menganalisis perusahaan yang lama dan yang akan datang, untuk masa depan yang lebih baik.',	'Mimpi terbesar saya yaitu menjadi the next generation yang sangat bermanfaat untuk orang lain dengan cara sebagian kecil mengikuti atau berkontribusi pada organisasi-organisasi di dalam kampus.',	'Ketika SMA, saya pernah menjadi sekretaris OSIS. Dan ketika kuliah saya mengikuti organisasi English Club dengan formatur sebagai Bendahara departemen acara.',	1,	1654347541,	NULL,	0),
('SCHLR-SRHRD-556b55',	'USR-SRHRD-d3223',	'Sarah Ardelia ',	'2006-05-26',	'83808048717',	'Jl. Raya Tajur Gg.Tanuwijaya RT004/003 Kel. Tajur Kec.Bogor Timur, Kota Bogor,Jawa Barat, Indonesia ',	'Keagamaan (Ilmu Tafsir)',	'MA Negeri 2 Kota Bogor',	'3.98',	'2',	'Nama saya Sarah Ardelia anak pertama dari 2 bersaudara ayah saya seorang pegawai swasta dan ibu adalah ibu rumah tangga. Saya sangat suka bernyanyi bagi saya bernyanyi adalah sebuah hobby. Saya termasuk orang yang extrovert namun terkadang bertemu orang banyak bisa membuat saya pusing tapi saya sangat suka bersosialisasi dan memiliki relasi yang luas, saya sangat suka mencoba hal baru. Cita-cita saya menjadi seorang guru karena saya sangat suka dunia pendidikan meskipun nilai saya belum bisa dikatakan sempurna namun saya sangat suka lingkungan sekolah, saya ingin suatu saat nanti bisa menjadi orang yang berkontribusi dalam bidang pendidikan khususnya untuk negara ini.',	'Mimpi terbesar dalam hidup saya adalah menjadi orang yang sukses dan bisa membahagiakan orang tua, mungkin itu cukup global dan pasti semua orang menginginkannya. Saya ingin sekali menjadi seorang guru atau orang yang berkontribusi dalam bidang pendidikan. Cara saya untuk mewujudkan mimpi tersebut adalah dengan membuat planning-planning kecil seperti belajar, mendapatkan nilai yang bagus disekolah dan mengikuti berbagai kegiatan untuk mengembangkan potensi yang saya miliki. Saya juga mempunyai keinginan untuk melanjutkan studi ke luar negeri untuk mencapai hal tersebut biasanya diwaktu luang saya menyempatkan untuk berlatih bahasa, bahasa negara yang saya ingin tuju. Selain itu kini saya masih selalu menggali informasi dari berbagai sumber terutama media sosial untuk mengetahui informasi terkait Universitas yang saya inginkan.',	'Saya memiliki cukup banyak pengalaman dalam organisasi.\r\nPada saat SMP saya mengikuti organisasi Pramuka disekolah, di pramuka saya pernah menjabat sebagai Pratama Putri (Pemimpin Regu Utama) Putri dan saya berhasil meraih penghargaan sebagai Pramuka Garuda tingkat Nasional pada tahun 2020 dan saya juga tergabung dalam organisasi pramuka tingkat Internasional yaitu ATAS (Association of Top Achiever Scout) atau Asosiasi Pramuka Garuda sedunia\r\n\r\nLalu ketika SMA saya masih tetap melanjutkan untuk berorganisasi. Di SMA saya mengikuti 3 Organisasi 2 di sekolah dan 1 di luar sekolah. Di sekolah saya mengikuti organisasi Pramuka dan MPK.\r\nMPK atau Majelis Perwakilan Kelas, disini saya menjabat sebagai Wakil Sekretaris Umum dan sering menjadi panitia di kegiatan-kegiatan yang ada disekolah.\r\nLalu diluar sekolah saya menjadi anggota organisasi FPSH HAM (Forum Pemuda Sadar Hukum Dan HAM) Kota Bogor',	1,	1654424073,	NULL,	0),
