('SCHLR-SRJMM-429f01',	'USR-SRJMM-95411',	'Sirojum Munir',	'2002-04-18',	'85784952385',	'Jl. Telaga asinan Rt. 10 Rw. 04 Ds. Wotan Kec. Panceng Kab. Gresik',	'Hukum Keluarga Islam/Syariah&H',	'UNIVERSITAS ISLAM NEGERI SUNAN',	'3.75',	'4',	'Dulu saya sangat pendiam dan tidak tidak suka banyak berbicara, seketika saya lulus dari jenjang MTS saya lanjut di sekolah MAN 3 TAMBAKBERAS JOMBANG, saya mondok disana, disana saya banyak belajar terutama belajar organisasi, dalam organisasi tersebut saya mulai memberanikan diri untuk speak up dan akhirnya setelah 1 tahun berjalan waktu pergantian ketua umum saya salah satu kandidat dari beberapa calon ketua yang ada,, alhamdulillahnya saya yang terpilih dan setahun berjalan alhamdulillah kata kakak-kakak alumni bilang kalau ada banyak kemajuan ketika waktu laporan pertanggung jawaban. Kemudian setelah lulus dari man 3 tambakberas jombang  saya melanjutkan ke UIN Sunan Ampel surabaya, saya disini merasa ilmu organisasi saya kurang akhirnya saya ikut organisasi daerah yang mana disebut organisasi IMAGRES ( IKATAN MAHASISWA GRESIK) dan disini saya terus menggali ilmu saya dan ingin mewujudkan mimpi saya untuk membahagiakan orang tua saya. ',	'Mimpi terbesar saya adalah ingin menjadi advokat, dan cara saya mewujudkannya saya sangat ingin mendalami ilmu hukum secara komprehensif ',	'Iya, saya dulu pernah ikut OSIS waktu MTS, ikut organisasi daerah waktu di MAN 3 TAMBAKBERAS JOMBANG, di sekolah MAN 3 TAMBAKBERAS JOMBANG, saya mondok disana, disana saya banyak belajar terutama belajar organisasi, dalam organisasi tersebut saya mulai memberanikan diri untuk speak up dan akhirnya setelah 1 tahun berjalan waktu pergantian ketua umum saya salah satu kandidat dari beberapa calon ketua yang ada,, alhamdulillahnya saya yang terpilih dan setahun berjalan alhamdulillah kata kakak-kakak alumni bilang kalau ada banyak kemajuan ketika waktu laporan pertanggung jawaban. Dan sekarang waktu kuliah ikut organisasi daerah IMAGRES ',	1,	1654307561,	NULL,	0),
('SCHLR-SRNDR-b891ef',	'USR-SRNDR-cc76c',	'SRI INDRIANI MULIA',	'2002-06-24',	'85342289698',	'Jl Sahabat 5 Universitas Hasanuddin ,Makassar Sulawesi Selatan',	'Ilmu Keperawatan (S1)',	'Universitas Hasanuddin',	'3.8',	'4',	'Halo, saya Sri Indriani Mulia salah satu mahasiswi S-1 Ilmu Keperawatan Fakultas Keperawatan Universitas Hasanuddin. Saat ini saya mahasiswi semester 4 yang sedang di fase menghadapi banyaknya tugas kuliah. Selain fokus kuliah saya juga bergabung dengan organisasi kemanusiaan Korps Sukarela PMI Universitas Hasanuddin sejak 2021. Seringkali mengikuti beragam webinar kesehatan, berpartisipasi dalam kegiatan volunteer dan berminat dalam bidang pengabdian masyarakat',	'Mimpi terbesar saya ialah ingin menjadi perawat profesional dan sebagai perawat edukator. Cara mewujudkannya ialah dengan memanfaatkan masa-masa kuliah dengan membangun relasi dan menambah pengalaman untuk membangun pribadi menjadi lebih baik. Sukses dalam pendidikan dan mempunyai banyak relasi agar dapat memberikan impact kedepannya',	'Saat ini saya tergabung dalam UKM KSR PMI Unhas dan selama tergabung menjadi anggota di tahun 2021 saya pernah menjadi anggota crew dalam kegiatan Aksi Relawan 2021 yang di laksanakan di Desa Laiya, Maros, Sulawesi Selatan. Desa ini merupakan salah satu desa yang sangat terpencil bahkan akses jalanan yang kurang baik mengakibatkan masyarakat disana kurang mampu mengakses fasilitas kesehatan. Di kegiatan ini kami menyediakan fasilitas berupa medical check up dengan menghadirkan 2 orang dokter dan dibantu oleh beberapa orang dari tim UKM kami. Selain itu kita juga mengadakan kegiatan khitanan secara gratis bekerja sama dengan pihak yang ahli di bidang tersebut untuk anak laki-laki didesa itu. Terdapat pula kegiatan mengajar anak di sekolah dasar dan hal ini membuat saya mendapatkan banyak pengalaman baru',	1,	1653701017,	NULL,	0),
('SCHLR-SRNT-f09e30',	'USR-SRNT-2072d4',	'Isra Antu',	'2001-10-21',	'82259022077',	'Iloheluma, Kec. Tilongkabila Kab. Bone Bolango Prov. Gorontalo',	'Matematika/Pendidikan matemati',	'Universitas negeri Gorontalo',	'3.12',	'4',	'I am Isra Antu, a village boy who was born to a farming family and is currently continuing his education in the city of Gorontalo.',	'I want to study Masters in Turkey at al-ahzab university, at this time I have started looking for information about the scholarship. ',	'When I was in high school, I was involved in student council organizations, scouts, PMR, and religious organizations, I was also a member of Saka Bahari. In addition to the school organization, I have also been part of the SAR Team.',	1,	1654574012,	NULL,	0),
('SCHLR-SRRHM-c3f59e',	'USR-SRRHM-38100',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654186144,	NULL,	0),
('SCHLR-SRRHM-d1624f',	'USR-SRRHM-f8cb4',	'Sari Rahmawati',	'2002-04-01',	'85104715254',	'Green Palm B-13, Jalan Sampurna\r\nMalang, Jawa Timur',	'Sistem Informasi',	'Universitas Brawijaya',	'3.86',	'4',	'Saya Sari Rahmawati merupakan mahasiswa Universitas Brawijaya Fakultas Ilmu Komputer yang saat ini sedang semester 4. Saya mengambil Fakultas ini karena melihat peluang yang besar dimasa yang akan datang. \r\nSelama saya berkuliah, saya mengasah hardskill saya dengan belajar serta mengikuti berbagai kompetisi seperti bisnis case, bisnis plan, pengembangan UI Design hingga karya tulis ilmiah. Selain itu saya juga mengasah softskill yang akan saya butuhkan untuk jenjang karir saya kedepannya.',	'Saya Sari Rahmawati merupakan mahasiswa Universitas Brawijaya Fakultas Ilmu Komputer yang saat ini sedang semester 4. Saya mengambil Fakultas ini karena melihat peluang yang besar dimasa yang akan datang. \r\nSelama saya berkuliah, saya mengasah hardskill saya dengan belajar serta mengikuti berbagai kompetisi seperti bisnis case, bisnis plan, pengembangan UI Design hingga karya tulis ilmiah. Selain itu saya juga mengasah softskill yang akan saya butuhkan untuk jenjang karir saya kedepannya.',	'Saat saya kuliah, saya mengikuti organisasi serta kepanitiaan pada tingkat Fakultas.\r\nPada semester 2 dan 3 saya mengikuti BEM tingkat fakultas yang saat itu saya mendapatkan amanah menjadi staff karir dan minat bakat. Saat itu saya membantu mahasiswa dalam mendalami bagaimana dunia kerja dengan mengundang alumni serta kami juga mengadakan suatu kompetisi IT tingkat nasional. Selain itu saya mengikuti beberapa kepanitiaan serta relawan seperti kegiatan orientasi mahasiswa baru, relawan untuk mengunjungi panti asuhan daerah Malang hingga relawan untuk memberikan gambaran perkuliahan bagi siswa SMA.',	1,	1655730113,	NULL,	0),
('SCHLR-SRTMN-3a3556',	'USR-SRTMN-b033b',	'Suratman',	'2000-11-11',	'83154824061',	'Desa Langse, Kecamatan Karangsambung, Kabupaten Kebumen, Jawa Tengah',	'Peternakan Fakultas Peternakan',	'Universitas Diponegoro',	'3.83',	'4',	'Saya Suratman, saat ini sedang menjalani studi semester empat di Universitas Diponegoro jurusan Peternakan. Saya berasal dari desa kecil di kota Kebumen, Jawa Tengah. Saya lahir dari orang tua buruh tani yang pekerjaanya mencangkul dan membersihkan ladangg orang lain. Sejak kecil, saya sering diajak orang tua saya untuk pergi ke sawah, mengantarkan makanan, minum, atau sekedar untuk mengusir burung yang memakan padi. \r\nOrang tua saya mungkin memang bukan yang punya pendidikan tinggi. Tapi soal mendidik, beliau adalah orang yang sangat baik. Akhir-akhir ini, saya menyadari beberapa persamaan sifat antara saya dan orang tua saya. Misalnya, saya ini paling tidak bisa ketika melihat ruangan yang berantakan sama seperti ibu saya. Kemudian, saya ini akan komitmen dengan target, agak pelupa, dan inginya cepat-cepat tugas selesai, persis seperti bapak saya. Agaknya memang benar pepatah yang mengatakan bahwa buah jatuh tidak jauh dari pohonya. ',	'Jujur saja, dulu, mimpi terbesar saya adalah bisa kuliah. Kuliah bagi saya adalah suatu hal yang luar biasa. Bisa berada di titik ini sekarang adalah buah dari kerja keras dan semangat yang selalu dijaga. Bagaimana tidak, dulu saya sempat gap year sebab orang tua saya tidak setuju kalau saya melanjutkan kuliah. Orang tua saya hanya buruh tani lulusan SD. Bagi mereka, membayangkan biaya besar yang akan dikeluarkan untuk pendidikan di kuliahan pasti sangatlah sulit. Lagipula, dulu, saya melihat bahwa bagi orang tua saya, pendidikan bukanlah sesuatu yang mereka anggap utama. Tidak tahu kalau sekarang.\r\nSingkat cerita, setelah lulus SMA saya terpaksa mengikuti perkataan orang tua saya untuk tidak melanjutkan kuliah dan memilih bekerja. Akan tetapi, semangat ddan mimpi untuk bisa melanjutkan kuliah tidak pernah saya hapuskan dari diri saya. Saat itu, saya sempat bekerja di rumah makan di kota saya. Saya bekerja pagi mulai pukul 10.00 dan selesai pukul 17.00. Begitu setiap harinya. Seringkali, ketika melihat teman-teman saya yang melanjutkan kuliah, saya merasa iri, jujur saja. Tapi akhirnya, justru rasa iri itu yang semakin mengobarkan diri saya untuk melanjutkan kuliah. Beberapa bulan menjelang UTBK, saya mulai belajar lagi. Sepulang bekerja, saya biasanya mampir ke rumah teman-teman saya untuk belajar. Selama beberapa bulan tersebut, orang tua saya tidak tahu kalau saya sedang mempersiapkan diri untuk UTBK. Sampai akhirnya saya memberitahu beliau semalam sebelum saya melaksanakan tes. Orang tua saya hanya diam. Mungkin beliau sedang membayangkan berapa banyak uang yang harus dikumpulkan dan pekerjaan apa yang bisa segera dilakukan. Tidak ada penolakan dari beliau. Paginya, saya berangkat melaksanakan UTBK di kota sebelah dan alhamdulilah dapat mengerjakan dengan baik. Dan ya, sekarang saya disini, sedang menikmati mimpi yang dulu saya ukir. Oh iya, biaya ukt saya dibantu oleh pemerintah sehingga orang tua saya sama sekali tidak mengeluarkan biaya untuk pendidikan saya. \r\nUntuk saat ini, mimpi terbesar saya adalah bisa menjadi bagian dari Indonesia Mengajar. Sejak SMA, ketika ditanya mimpi mu apa? pasti selalu saya jawab saya ingin kuliah dan ingin jadi pengajar muda, program indonesia mengajar. Sekarang ini, saya sudah selangkah lebih dekat dengan mimpi saya. Saya sadar, kalau mengejar mimpi memang tidak mudah. Jika memang harus jeda, maka berhenti sejenak tidak apa apa. Yang terpenting bagi saya adalah bagaimana bisa menjaga motivasi itu tetap menyala.',	'Dari SMP saya sudah mulai aktif berorganisasi. saat SMP dan SMA, saya mengikuti PMR dan OSIS. Kemudian sekarang di kampus saya mengikuti kelompok studi ternak perah, himpunan, dan juga menjadi asisten laboratorium. Oh iya, dulu saat SMA sempat juga mengikuti komunitas pemuda siaga bencana. Kenapa saya begitu tertarik dengan organisasi? Jawaban terbaik saya adalah bahwa pendidikan formal saja belum cukup. Berorganisasi mengajarkan kita banyak sekali hal yang sudah pasti kita ketahui bersama. Dan yang tidak kalah penting adalah bahwa organisasi memberi kita koneksi. Koneksi yang mungkin saja suatu saat akan bisa membantu kita. ',	1,	1653803570,	NULL,	0),
('SCHLR-SRTSS-2211ae',	'USR-SRTSS-48156',	'Usrotussa\'idah hash ',	'2000-06-13',	'83806102513',	'Surabaya, Jawa timur ',	'Ekonomi syari\'ah/Fakultas Ekon',	'UIN Sunan Ampel Surabaya ',	'3.80',	'4',	'Aku adalah seseorang yang terlahir istimewa ke dunia ini, dimana Tuhan menciptakan ku agar aku mampu menjadi salah satu agen perubahan dunia menjadi lebih baik. Karena untuk apa kita memiliki kelebihan, jika kelebihan tersebut dipergunakan untuk merusak buminya dan manusianya? Ketika aku sadar, bahwa aku harus bercita-cita besar, aku harus bermimpi besar, karena yang aku perjuangkan bukan hanya masa depanku seorang, melainkan masa depan seluruh manusia. Dan tentunya tidak cukup hanya dengan cita-cita dan mimpi, akan tetapi aku harus tetap melakukan usaha semaksimal yang aku bisa agar dapat mewujudkannya.',	'Mimpi terbesar ku adalah memberikan perbaikan bagi dunia, karena sungguh aku sadar, bahwa dunia sedang tidak baik-baik saja, dimana kerusakan dan ketidak-adilan terjadi dimana-mana. Cara ku untuk mewujudkannya adalah pertama, menimba ilmu dengan sebanyak-banyaknya, karena jika aku ingin menaklukkan dunia dan akhirat, maka aku harus menaklukkannya dengan ilmu. Kedua, dengan menerapkan ilmu yang sesuai dengan keyakinan ku dalam kehidupan. Ketiga, memberikan dampak positif bagi orang-orang yang ada dilingkungan ku dengan mencoba mencari solusi dari segala permasalahan yang terjadi di depan mata.',	'Iya\r\n1. UKM Pengembangan Tahfidzul Qur\'an: Koordinasi Fakultas Ekonomi dan Bisnis Islam\r\nDi organisasi ini saya belajar bagaimana cara memimpin teman-teman saya atau pun kakak tingkat saya yang satu fakultas \r\n2. UKM Griya Derma: Ketua divisi media dan IT \r\n',	1,	1655733340,	NULL,	0),
('SCHLR-SSKDS-72db6e',	'USR-SSKDS-9c7d7',	'Siskadea Sawitri Nasution',	'2001-04-15',	'82364500144',	'Kelurahan Panyanggar, Gang Durian, Kecamatan Padangsidimpuan Utara, Kota Padangsidimpuan, Sumatera Utara, 22714',	'Akuntansi Sektor Publik',	'Universitas Padjadjaran',	'3.75',	'4',	'Saya adalah orang yang ambisius dalam mengejar cita-cita saya. Jika saya tertarik akan suatu kegiatan saya akan berusaha mendapatkannya dengan usaha dan skill yang saya miliki. Namun, saya memiliki masih kendala dalam hal ekonomi. Jika suatu kegiatan yang ingin saya ikuti memiliki commitment fee saya akan tetap mengikuti karena pengembangan skill di luar akademik sangat penting bagi saya. Saya pernah gagal dalam 18 kali percobaan dalam seleksi masuk universitas di Indonesia. Namun berkat kegigihan dan dukungan dari orang tua saya mampu melewati kesusahan tersebut dan kini sedang menjalani kuliah di Universitas Padjadjaran. Saya selalu ingin menyeimbangkan minat akademik dan non akademik saya. Saya memiliki ipk yang cukup memuaskan dan juga pernah menjuarai perlombaan karya tulis ilmiah tingkat nasional dengan dua anggota tim saya lainnya. Selain itu, saya juga pernah ikut berpartisipasi dalam penyusunan naskah akademik dalam penyusunan rancangan Peraturan Daerah Kabupaten Garut tentang Pengelolaan Keuangan Daerah yang dinaungi oleh Kepala Pusat Studi Akuntansi Universitas Padjadjaran. Cerita tersebut bebrapa dari kegiatan akademik saya. Semenara dalam kegiatan non-Akademik saya aktif mengikuti organisasi. Saya pernah menjadi ketua panitia pelaksan ospek jurusan Akuntansi Sektor Publik 2021 dimana kegiatan tersebut berhasil mengembangkan jiwa kepemimpinan, problem solving, dan chritical thinking saya. Sekarang saya tengah mengikuti organisasi Himpunan Mahasiswa Akuntansi Sektor Publik sebagai Board of Director Internal. Namun, dari sisi saya harus mengejar cita-cita dan mengisi kehidupan dengan hal-hal yang bermanfaat dan membentuk diri, saya harus mencari beasiswa sebagai bantuan bagi saya dalam hal financial agar saya tetap dapat fokus akademik dan non akademik. Saya tidak ingin menyusahkan kedua orang tua saya dengan berbagai kegiatan yang saya jalani semasa kuliah, karena orang tua saya masih memiliki 4 orang adik yang masih bersekolah dan harus ditanggung biaya nya.',	'Mmpi terbesar saya adalah saya bisa menyelesaikan pendidikan hingga S3 dan mampu menjadi seorang  leader di suatu perusahaan sehingga saya menjadi orang yang inspiratif ataupun panuutan bagi orang di sekitar saya. Cara saya mewujudkannya adalah dengan fokus belajar dan mencari kegiatan di luar akademik dengan mengikuti kegiatan organisasi untuk membantuk jiwa kepemimpinan saya dan survive di dunia yang bersaing ini.\r\nSehingga nantinya ketika saya menjadi orang sukses, saya ingin membantu orang-orang yang sama seperti saya, yaitu orang-orang yang memiliki kemauan belajar namun masih terkendala dalam biaya(ekonomi).',	'Ya, saya telah/sedang mengikuti beberapa kegiatan organisasi. Saya menjadi Asisten Manajer HRD 2020 Himpunan Mahasiswa Akuntansi Sektor Publik 2020, Menjadi Secretary pada Financial Market Community FEB Unpad 2020, dan sekarang menjadi Board of Director Internal HIMA ASP 2021. Pengalaman tersebut saya ikuti untuk berkontribusi pada jurusan saya dan membentuk karakter diri saya sebagai salah satu sumber daya manusia yang memiliki skill leadership, self development, problem solving dan masih banyak lagi.',	1,	1653918587,	NULL,	0),
('SCHLR-SSKSS-08fea3',	'USR-SSKSS-6ee33',	'Siska Susilawati',	'2002-03-20',	'82177881053',	'Dsn. Krajan rt.06 rw.02 Ds. Sukahaji Kec. Ciasem Kab. Subang 41256 Jawa Barat',	'Pendidikan Matematika ',	'Universitas Singaperbangsa Kar',	'3.68',	'4',	'saya adalah seseorang yang bertanggung jawab, disiplin, dan loyal terhadap suatu organisasi atau lembaga yang saya jalani. saya juga memiliki kemampuan bersosialisasi, public speaking dan time management yang cukup baik. selain beberapa hal di atas prestasi saya di bangku perkuliahan juga cukup baik, dimana selama 3 semester kemarin nilai saya berada di angka >3.00',	'Mimpi terbesar saya adalah dengan menjadi eseorang yang sangat berpengaruh dalam pendidikan Indonesia, cara saya mewujudkan mimpi saya dengan berjuang dan berusaha dalam bidang yang akan saya tekuni nantinya dan mencoba menjadi yang terbaik di bidang saya sehingga saya akan dekat dengan mimpi saya nantinya',	'saya mengikuti organisasi sejak saya SMP. Namun, saya merasakan organisasi sesungguhnya di bangku SMA dan kuliah. Di SMA saya mengikuti Organisasi OSIS sebagai ketua divisi Wawasan Kebangsaan dan Bela Negara dan ekstrakurikuler PASKIBRA sebagai Ketua Umum. Lalu di bangku perkuliahan saya mengikuti Organisasi Mahasiswa Himpunan Mahasiswa Pendidikan Matematika sebagai pengurus Bidang Pengembangan dan Riset Organisasi, lalu saya juga pernah mengikuti relawan atau volunteer, yaitu pada kegiatan FGTS (Formadiksi Goes To School), dimana kegiatan ini merupakan kegiatan yang mensosialisasikan beasiswa KIP Kuliah kepada siswa SMA kelas XI dan XII dan FEST (FKIP\'S Education and Social Training), dimana kegiatan ini merupakan kegiatan pelatihan pendidikan dan kewirausahaan yang di aplikasikan kepada masyarakat dengan mengajar di SDN Malangsari 1, 2 dan 3 dan mensosialisasikan peluang kewirausahaan masyarakat setempat',	1,	1654222796,	NULL,	0),
('SCHLR-SSSLH-6ad0cb',	'USR-SSSLH-7361b',	'Essa Saleha',	'2000-10-01',	'82374991962',	'Perumahan Griya Muara Dua Sejahtera Blok H no 5',	'Pendidikan Bahasa Arab/FITK',	'UIN Raden Fatah Palembang',	'3.80',	'4',	'Mahasiswi yang memiliki antusias dan semangat yang tinggi untuk lulus dengan cepat. Aktif diberbagai organisasi internal dan eksternal serta mempunyai pengalaman kerja. Mempunyai motivasi \"Bermanfaat Untuk Orang Lain\" dan \"Jadilah Perantara-Perantara Kebaikan\". ',	'1. Menaikkan haji ibu dan keluarga. Dengan cara belajar sungguh-sungguh, bermanfaat untuk orang lain dan berbakti kepada ibu\r\n2. Mendirikan sekolah islami dan Rumah Qur\'an Gratis. Dengan cara membangun relasi yang baik kepada masyarakat, bermanfaat untuk sekitar dan semangat terus mengejar mimpi\r\n3. Membuka usaha bisnis sendiri. Dengan cara berbakti kepada ibu dan tanamkan diri, hati dan pikiran Bekerja = Beramal\r\n4. Membeli mobil cash landasan utama ingin mengajak ibu jalan-jalan karena ibu jarang jalan-jalan. Selalu ada quality time family\r\n5. Menyekolahkan adik sampai lulus kuliah. Dengan cara semangat mewujudkan mimpi terutama poin 1-4. ',	'Iya.\r\n1. Relawan di lembaga zakat. Diperlukan saat acara hari-hari besar Islam\r\n2. Wakil 1 ROHIS SMA. Bersyukur bisa diamanahkan di sini, banyak pelajaran yang dapat di ambil serta hikmah yang diperoleh\r\n3. Tekspram (bagian pemateri) pramuka SMA. Disini tempat belajar dan pembelajaran terjadi. Bisa kolaborasi, dan kerja sama. Serta bisa memberikan ilmu yang saya punya.\r\n4. Anggota Syiar IRKOP (ikatan rohis kota Prabumulih). Syiar menjadi garda terdepan untuk dakwah rohis.\r\n5. LDK Refah. Disini tanamkan untuk tetap dakwah walaupun Pascasarjana dan sudah berkeluarga. Pengalaman ketua divisi syiar. Menjadi garda terdepan dakwah. Pengalaman menjadi Biro Kestari, divisi database. Dan amanah menjadi mentor mahasiswa baru',	1,	1655604431,	NULL,	0),
('SCHLR-STHRY-f1fe4d',	'USR-STHRY-c2a2e',	'Esther Yohana S',	'2003-06-15',	'87793848128',	'Jl. Bendungan Tangga no 3b Kota Malang',	'Prodi Pendidikan Bahasa Mandar',	'Universitas Negeri Malang',	'3.89',	'2',	'Saya merupakan anak pertama dari 3 bersaudara. Saya lahir dan dibesarkan di Kota Pekanbaru Provinsi Riau. Dari kecil saya suka mencoba dan mengeksplor hal-hal baru  seperti disaat SD saya mencoba menjadi guru (yang mengajar) adik-adik di tempat ibadah sehingga hingga saat ini saya suka untuk mengajar. Lalu saat saya SMA,saya mencoba untuk berjualan dan mengedit video,maka sejak saat itu kedua hal tersebut yang akhirnya menjadi hobi saya. Saya juga suka mempelajari bahasa asing seperti korea dan mandarin. Menurut teman-teman dan orang sekitar saya,saya orang yang humoris dan aktif. ',	'Mimpi terbesar saya ialah menjadi seorang entreprenuer dan guru yang berkualitas dan bermanfaat bagi orang lain. Cara saya mewujudkannya dengan cara saya mempelajari ilmu tentang bisnis di suatu pelatihan,mengikuti lomba,workshop,mentoring dan mengembangkan ide saya langsung. Sedangkan untuk menjadi guru,saya mendalami ilmu kependidikan,terus mempelajari cara menjadi guru yang dibutuhkan dan diminati orang dan selalu mengajar mulai dari teman-teman saya terlebih dahulu.',	'Ya,saya punya. Saya tergabung menjadi pengurus di suatu UKM di kampus saya yaitu Ikatan Mahasiswa Kristen (IMAKRIS). Lalu saya menjadi anggota aktif di UKM Penulis dan Ikatan Pecinta Retorika. Saya memiliki pengalaman menjadi relawan seperti relawan dalam kepantiaan sebagai humas,divisi konsumsi dan kesehatan.',	1,	1653908961,	NULL,	0),
('SCHLR-STKLN-cac3a0',	'USR-STKLN-7551a',	'ASTIKA A. LA ANE S.',	'2002-09-20',	'82191860838',	'Desa Onemay, Kec Taliabu Barat Laut, Kab Pulau Taliabu, Prov. Maluku Utara ',	'S1/Psikologi/Ekonomi dan Sosia',	'Universitas Jenderal Achmad Ya',	'3.75',	'4',	'Assalamu\'alaikum warahmatullahi wabarokatuh\r\nHallo semuanya perkenalkan nama saya Astika A. La Ane S. Saat ini sedang melanjutkan studi di Universitas Jenderal Achmad Yani Yogyakarta dengan program studi Psikologi. Saya merupakan anak ke dua dari 3 bersaudara, dan terlahir dari keluarga yang sederhana.\r\nAsal saya dari salah satu desa terpencil yang ada di Maluku Utara tepatnya di Nggele kab.Pulau Taliabu. Berasal dari keluarga yang sederhana dengan latar belakang pendidikan yang kurang memadai di daerah saya, tidak membuat menyerah, hal ini justru membuat saya semangat dalam menggapai cita-cita. Berjalan kaki dari rumah kesekolah terkadang menimbulkan rasa lelah pada diri saya, namun demi harapan diri, keluarga dan negara saya mengalahkan semuanya. \r\nSejak kecil saya sangat suka dalam kegiatan sosial apalagi itu berkaitan dengan orang banyak dan mampu memberikan kebermanfaatan bagi orang banyak. Kemudian setelah lulus SMA saya mencari peluang untuk berkuliah di Jogja selayaknya anak-anak yang lain. Alasan saya memilih disini karena saya masih sangat butuh akan ilmu pendidikan yang tidak pernah saya temui di tempat asal saya.\r\nSemoga nanti segala harapan dan niat baik saya, di ijabah oleh Allah SWT.',	'Mimpi besar saya ialah dapat mendorong anak-anak yg ada di daerah saya, agar dapat mengenal dunia pendidikan lebih dekat. Karena didaerah saya terlihat anak-anak yang banyak putus sekolah hanya karena keterbatasan ekonomi dan pergaulan yang ada, pada dasarnya prinsipnya anak-anak didaerah saya adalah \"Untuk apa kuliah jika nantinya setelah selesai hanya menganggur\". Padahal menurut saya itu merupakan sesuatu yang keliru, dan pola pikir seperti itu perlu untuk di ubah. Selain itu dengan keterbatasan pendidikan yang tidak memadai membuat pendidikan disana mengalami ketertinggalan, yang pada akhirnya ketika menginjakkan kaki di kota, banyak yg terlihat bingung. Itulah mengapa perlu memajukan sistem pendidikan yang ada disana. Kemudian untuk mencapai mimpi tersebut, maka sesuatu yang dapat dilakukan ialah dengan menumbuhkan keinginan anak-anak agar mau bersekolah dengan cara membangun organisasi duta baca bagi anak-anak, menyiapkan buku yang cukup (sesuai kebutuhan), melakukan berbagai pelatihan dengan menghadirkan orang-orang yg kompeten di bidangnya, memberikan berbagai perlakuan seperti konselin yang dapat dilakukan agar mau menceritakan suatu keadan yg memicunya tidak ingin melanjutkan pendidikan dan lain-lain. Akan tetapi bagi saya yg terpenting dalam mencapai mimpi tersebut perlu adanya pembekalan yg lebih dalam dan banyak pada diri saya dengan mengikuti berbagai pelatihan dn kegiatan yg ada, hanya saja untuk mengikuti kegiatan tersebut tentu memerlukan biaya yang cukup. Sementara saya yang hanya berasal dari keluarga sederhana ini tidak memungkin bisa berinvestasi sebayak itu.\r\nOleh karena itu, harapan saya semoga bisa menjadi bagian dari beasiswa ini, agar nanti bisa mengembangkan potensi dan kebutuhan dalam memajukan pendidikan yg ada di daerah saya.',	'Sejak kecil saya sangat senang bersosialisasi, hal ini kemudian mendorong saya untuk mengikuti berbagai kegiatan bahkan organisasi yang ada, selama menempuh pendidikan.\r\nKemudian saat berada di jenjang SMP saya menjadi pengurus OSIS yg saat itu saya ditempatkan sebagai Bendahara OSIS, juga menjadi ketua kelas dari kelas 1 semester S/d kelas 3 (lulus). Disisi lain saya biasa diundang untuk melantunkan ayat suci al-quraan (tilawah) dikegiatan keagaamaaan seperti Isra mi\'raj, maulid nabi, dsb. Pernah juga waktu SMP saya diutus perwakilan kecamatan untuk mengikuti lomba Tilawah dan Alhamdulillah saat itu saya mendapat juara 3. Kemudian setelah beranjak ke bangku SMA, saya mengikuti berbagai organisasi yang ada seperti anggota div.pendidikan dan pelatihan, menjadi ketua kelas sejak kelas 2-3(lulus), mejadi anggota PASKIBRAKA, mengikuti kegiatan Marchiband, kemudian bisa pernah ketua dewan Ambalan Pramuka dn pernah mengikuti kegiatan Pramuka Tingkat Propinsi. Kemudian saat memasuki dunia kampus, saya aktif diberbagai kegiatan/organisasi yang ada seperti Dewan Perwakilan Mahasiswa (DPM), literasi psikologi Indonesia, menjadi pengurus Ikatan lembaga mahasiswa psikologi Indonesia berskala Nasional (ILMPI) dsb.',	1,	1655317911,	NULL,	0),
('SCHLR-STNLY-7ad42a',	'USR-STNLY-24462',	'Stanley Angkasa Sukendra',	'2003-10-26',	'8985245832',	'Jl. Wijaya Kusuma No. 7A, Duri Kosambi, Cengkareng, Jakarta Barat',	'Akuntansi',	'Trisakti School of Management',	'3.86',	'2',	'Nama saya Stanley Angkasa Sukendra, Biasanya dipanggil Stanley. Saya berusia 18 tahun. Saat ini saya tinggal di Jakarta.  Saya berkuliah di Trisakti School of Management, dengan jurusan akuntansi yang sekarang berada di semester 2. Motivasi saya ingin mengembangkan, melatih, dan mempersiapkan diri sebagai pemimpin. Juga membentuk jati diri dan karakter yang unggul. Dengan pengalaman saya di TSM. Disini saya dilatih softskill dan hardskill yang berguna untuk career saya kedepannya,.\r\nSelain itu, kesibukkan saya diluar kuliah yaitu mengikuti course diluar kampus, membuat video kreatifitas untuk media sosial, menggambar, bermain tenis meja. Selain itu, saya suka mengikuti webinar yang bermanfaat.\r\nSaya memiliki komitmen yg tinggi dalam menyelesaikan sesuatu yg sudah dimulai. Hal itu terbukti, organisasi maupun volunteer saya dapat menyelesaikan baik program kerja dan jobdesk yang diberikan, Saya terkadang lupa waktu saat mengerjakan sesuatu, Tapi hal itu saya atasi dengan memasang alarm dan jadwal yang terstruktur.',	'Secara pribadi, saya suka merapikan dan mengorganisir hal-hal. Sejak dahulu. saya terbiasa membereskan sekitar. Saya ingin bisa terus melakukan apa yang saya suka, merapikan dan mengorganisir hal-hal dengan baik. Dan saya juga akan memiliki beberapa sertifikat terkait skill akuntansi saya, jadi saya harap saya bisa menggunakannya di kehidupan nyata terutama pada pekerjaan saya. Pertama-tama, saya ingin belajar sebanyak mungkin agar lebih familier dengan bidang pekerjaan ini. Setelah bekerja 1 tahun, mungkin saya akan mulai mengikuti training untuk memperluas pengetahuan dan menambah pengalaman. Saya juga berencana melanjutkan pendidikan S2 saya untuk lebih mendalami profesi saya, Saya memilki mimpi menjadi Professional Auditor Accountant, \r\nSaya juga ingin berguna untuk orang lain, Saya berencana untuk membuka kelas kecil. Dimana saya dapat memberikan ilmu yang saya punya untuk orang lain, Seperti membuat channel Youtube dan menggunakan media sosial lainnya, Hal  itu saya lakukan sekarang, Ketika teman dan kerabat saya membutuhkan ilmu terkait yang saya miliki, Saya turut memberikan ilmu yang saya punya sesuai yang saya kuasai saat itu.',	'Selama saya kuliah, saya juga mengikuti organisasi di kampus, yaitu \r\n- Wakil ketua UKM Tenis Meja, dimana saya bertugas untuk membantu mempersiapkan program kerja bersama anggota yang lain. Seperti, membuat proposal, membantu mengarahkan anggota lain, dan lain lain\r\n- Divisi Perkap dan Liturgi UKKA (Unit Kegiatan Kerohanian), dimana kami mengadakan sebuah workshop. Saya bertugas mempersiapkan PPT dan memimpin doa selama acara, juga menjaga kelancaran peserta selama acara berlangsung.\r\n- Mengikuti PDOMK sebagai anggota\r\n- Mengikuti kelas di luar kampus, yaitu Trust Jakarta (Campus 101). Dimana saya mengikuti kelas toefl dan kelas design selama 6 bulan.\r\n\r\nSelain itu saya juga menjadi volunteer, antara lain :\r\n- Divisi Design IMA (Indonesia Marketing Association) TSM, dimana disini saya mengerjakan beberapa project poster untuk di upload di media sosial juga membuat dokumentasi program acara.\r\n- Divisi Writer INTIPS (Informasi dan TIps), dimana kamu membuat project Majalah INTIPS yang berguna untuk memberikan informasi dan tips seputar kampus yang berguna untuk mengenal lebih dalam mengenai kampus. Disini, saya bertugas untuk penulisan majalah yang telah disusun materi oleh divisi journalist. \r\n',	1,	1655727462,	NULL,	0),
('SCHLR-STNRL-f44b6a',	'USR-STNRL-6a7c4',	'Siti Nur Lailatul Fitriyah',	'2003-10-01',	'85649292898',	'Gg. Darusalam, RT 21B, RW 05, Plandi, Jombang, Jawa Timur',	'Kimia/S1 Kimia/Matematika dan ',	'Universitas Negeri Malang',	'3.86',	'2',	'Saya ada seorang yang memiliki kepribadian dapat membagi waktu dengan baik. Sebelum saya melakukan sesuatu, saya selalu membuat rencana apa yang akan saya lakukan dan memperkirakannya agar tidak terjadi bentrok antara kegiatan yang satu dengan yang lain. Hal tersebut membuat saya menjadi terarah dan tidak terburu-buru dalam melakukan sesuatu.',	'Saya berkeinginan untuk bekerja di perusahaan ternama. Cara saya mewujudkannya yaitu dengan menjadi pribadi yang disiplin dan dapat mengatur waktu dengan baik. Saat ini saya sedang berkuliah, sehingga hal yang dapat saya lakukan yaitu berkuliah dengan sungguh-sungguh demi masa depan saya. Dengan menjalankan dengan maksimal.',	'Saya mengikuti organisasi Ikatan Mahasiswa Jombang Universitas Negeri Malang. Saya sebagai anggota divisi pengabdian masyarakat. Alasan saya memilih divisi tersebut karena saya berkeinginan untuk berinteraksi secara langsung dengan masyarakat untuk kebaikan masyarakat. Agenda dari divisi saya yang telah terlaksana yaitu bagi-bagi takjil. Dalam agenda tersebut saya sebagai koordinator sie konsumsi. Dengan terlaksana agenda tersebut meningkatkan kepedulian saya terhadap sesama. Oleh karena itu, mengikuti organisasi dapat memberikan pengalaman yang baik.',	1,	1655111867,	NULL,	0),
('SCHLR-STNRM-550ea6',	'USR-STNRM-39756',	'Siti Nur Meiva',	'2004-05-01',	'87872688411',	'Pandeglang, Banten',	'OTKP',	'SMKN 1 PANDEGLANG',	'8.1',	'6',	'Halo, saya Meiva usia saya 18 tahun. Saya selalu berusaha untuk melakukan yang terbaik dalam hal apapun, bertanggung jawab, jujur, dan selalu memiliki rasa penasaran untuk belajar hal baru.',	'Menjadi direktur utama adalah mimpi saya. Dalam hal ini tentunya harus berproses dari bawah dahulu, maka dari itu, saat ini saya mulai belajar lingkup perusahaan dan dunia kerja bersama Ayce talent growth course internship, dan saat ini juga saya melamar untuk menjadi freelancer',	'Pengalaman organisasi saya adalah menjadi wakil ketua OSIS dan English Conversation and Debating Club (ECDC). Menjabat 2 jabatan sekaligus bukan hal mudah tentunya, namun ada banyak hal positif yang saya dapatkan, seperti how to solve problem disituasi tertentu, bijaksana dalam memutuskan keputusan, mengayomi anggota, berkomunikasi dengan baik, dan masih banyak hal yang dapat saya aplikasikan nantinya.',	1,	1655314942,	NULL,	0),
('SCHLR-STPHN-269406',	'USR-STPHN-c1e99',	'Stephani Sitanggang',	'2002-09-05',	'82164585830',	'Jl Petunia Raya Per Griya Kencana Blok B No 7',	'Jurusan Ilmu Keolahragaan ',	'Universitas Negeri Medan',	'3.90',	'3',	'Nama saya Stephani Sitanggang biasanya teman-teman memanggil saya Stef\r\nSaya sekarang sedang menempuhh kuliah di Universitas Negeri Medan Fakultas Ilmu Keiolahragaan Jurusan Ilmu Keolahragaan.\r\nSaya suka berolahraga sejak SD, ketika itu saya ditawari guru mengikuti perlombaan renang antar Sumatera Utara bawa nama sekolah. Biarpun saya gagal saat itu tetapi saya tidak berhenti untuk mencintai olahraga. Ketika SMP saya mengikuti pencak silat THS-THM hingga pada saat ini. Tetapi, pencak silat ini terlalu tertutup dan tidak luas sehingga saya ingin menambah pengalaman lainnya yang berbau alam seperti rafting. Saat ini kesibukan saya yaitu berlatih arung jeram untuk persipan PON tahun berikutnya. Tetapi tidak cukup dengan itu saya juga ingin mengasah lebih menambah pengalaman-pengalaman yang baik untuk menjadi modal saya di suatu hari nanti. Maka dari itu saya mengikuti Beasiswa Youth Break the Boundaries dengan harapan saya dapat membantu masyarakat membutuhkan dengan jasa ataupun ilmu yang saya miliki.',	'Saya memiliki impian menjadi dosen yang baik dan akrab dengan mahasiswanya. Karena saya sangat senang mengajar orang dengan ilmu yang sudah saya dapat dan cara saya untuk mewujudkannya adalah dengan cara rajin belajar selama berkuliah untuk mendapatkan IP yang baik tiap semester,  mengikuti beberapa webinar dan mengikuti scholarship untuk lebih mengasah pengalaman sehingga dapat menambah relasi teman dari berbagai penjuru Indonesia dan terakhir ingin mengikuti kampus merdeka.',	'Ya, saya sudah menjabat menjadi ketua kepelatihan selama 7 tahun di organisasi pencak silat THS-THM, saya sekarng juga menjadi kapten klub dalam olahraga arung jeram. Pengalaman dari organisasi tersebut sangat banyak seperti kita lebih mengenal karakter teman-teman kita berbeda-beda sehingga kita harus tau bagaimana untuk menyikapi diri kita. Kita harus tauu bagaimana yang lebih prioritas dalam me-manage waktu dan pastinya kita harus bertanggung jawab dalam suatu hal, baik menjadi atasan  maupun bawahan.',	1,	1655742570,	NULL,	0),
('SCHLR-STQLM-172e12',	'USR-STQLM-7114b',	'Siti iqlima',	'2002-09-14',	'82362206594',	'Jln.laksamana Malahayati. Lam Ujong, Baitussalam, Aceh besar.',	'teknik industri',	'universitas syiah kuala ',	'3.15',	'4',	'Perkenalkan saya siti iqlima merupakan mahasiswa universitas syiah kuala pada jurusan Teknik industry. Saya merupakan anak terakhir dari empat bersaudara. Melalui beasiswa ini saya sangat ingin mengupgrade skill saya dan mencoba hal baru yang belum saya ketahui sebeleumnya. Kelebihan saya adalah time management, tepat waktu, good listener, problem solving. Dan kekurangan saya adalah saya seorang introvert, jadi sedikit kesulitan dalam membangun komunikasi dengan orang baru. Bur I will try my best untuk memperbaikinya.',	'Setiap orang tentunya memiliki mimpi-mimpi yang ingin mereka wujudkan in the future. Mimpi saya adalah menjadi pembicara yang baik, melalui itu saya dapat memotivasi anak-anak bangsa dalam mewujudkan mimpi mereka dengan cerita perjuangan saya dalam mecapai mimipi-mimipi saya. Saya ingin menjadi seorang psikolog yang dapat membantu banyak orang menyelesaikan persoalan mereka. It’s sound strangly enough karena tidak sesuai dengan jurusan yang sedang saya jalani, but I make sure setelah selasai untuk sarjana pada jurusan ini saya akan mengambil psikologi terapan. Dan mendapatkan beasiswa untuk master psikologi. Saya juga ingin menjadi seorang penulis dan menceritakan sedikit banyak tentang pengalaman saya dan beberapa motivasi. Saya tau ini tidak mudah. Tetapi jika saya percaya akan kemampuan saya serta  memperkuat usaha dan berdoa, nothing imposimble.',	'Sejak saya duduk dibangku sekolah mengah akhir saya telah berpengalaman mengikuti organisasi yaitu OSDI dimana saya menjadi wakil pada divisi pengajaran. Tugas dari divisi tersebut yaitu menertibkan para santri untuk bersekolah pagi dan malam hari, mengadakan perlombaan yang berhubungan dengan Pendidikan serta mendisiplinkan para santri saat bersekolah. Salanjutnya, saat masuk dalam dunia perkuliahan tahun pertama saya masuk organisasi HMTI dan menjadi anggota untuk divisi PENDIK, dimana divisi ini tidak jauh barbeda dengan divisi yang pernah saya ambil di SMA, berhubungan dengan Pendidikan, dimana salah satu programnya adalah mengadakan pelatiahan membuat link-In, membuat surat lamaran, dll. Untuk tahun ke dua saya juga mejadi anggota HMTI pada divisi kerohanian. Dimana divisi ini bergelud pada bidang agama, seperti mengadakan tausiah setiap bulan untuk mahasiwa, mengadakan buka Bersama, serta kunjungan kepanti asuhun, dan banyak program positif lainnya.',	1,	1654870327,	NULL,	0),
('SCHLR-STRBL-221375',	'USR-STRBL-f1e3d',	'Satria Baladewa Harahap',	'2001-09-08',	'89696530344',	'Babakan Baru RT 03/ RW 08, Sukapada, Cibeunying Kidul, Kota Bandung, Jawa Barat',	'Teknik Informatika',	'Universitas Negeri Surabaya',	'3.76',	'4',	'Saya adalah seorang mahasiswa teknik informatika semester 4 di salah satu PTN di Surabaya. Saya penduduk Bandung, tetapi berdomisili di Sidoarjo, Jawa Timur. Keseharian saya adalah kuliah sambil merintis bisnis dropshipping, serta bekerja sebagai freelancer. Saya pernah bekerja sebagai tutor freelance matematika di beberapa startup, seperti Zenius, Colearn, dan salah satu bimbel di Bandung. Walaupun menjadi mahasiswa sudah cukup menyita waktu, tetapi saya bisa untuk mengelola waktu agar bisa disambi bekerja. Saya harus bekerja untuk memenuhi kebutuhan perkuliahan karena saya berasal dari keluarga tidak mampu. Namun, bekerja tidak membuat prestasi saya di perkuliahan menurun. Buktinya adalah saya bisa meraih IPK sementara hingga 3.76 dan meraih beberapa medali olimpiade nasional tingkat mahasiswa. Saya melakukan itu semua karena saya memiliki mimpi yang sangat kuat untuk bisa mengubah nasib keluarga sehingga saya pun bertekad untuk belajar dengan sungguh-sungguh di bangku kuliah untuk menggapai masa depan yang cerah. Harapannya, melalui Beasiswa Pemuda yang diselenggarakan oleh YBB Foundation, saya bisa tumbuh dan berkembang menjadi manusia yang berkualitas dan bermanfaat bagi orang banyak.',	'Mimpi terbesar saya adalah menjadi orang dengan kemampuan finansial tinggi. Alasannya adalah karena uang merupakan faktor segala hal. Jika saya memiliki kondisi finansial yang berkecukupan, saya dapat membantu dan memberdayakan lingkungan saya untuk tumbuh dan berkembang menjadi lebih baik. Karena tidak dapat dipungkiri bahwa untuk tumbuh dan berkembang, pasti dibutuhkan yang namanya uang. Saya ingin agar finansial saya mampu membuka lapangan pekerjaan bagi orang lain, mampu mengembangkan kemampuan orang lain, memberikan kesempatan pendidikan untuk anak-anak, dan memberi kesempatan masyarakat untuk mengembangkan usahanya melalui bantuan yang akan saya berikan kepada mereka nantinya. Dengan begitu, saya dapat menghidupi dan bermanfaat bagi orang banyak. Karena sebaik-baiknya manusia adalah yang paling bermanfaat bagi orang lain. Dan upaya saya agar dapat memiliki kemampuan finansial yang tinggi adalah dengan cara mempelajari ilmu berbisnis. Saat ini, saya telah merintis suatu bisnis dropshipping. Saya terus belajar bagaimana cara mengembangkan bisnis tersebut agar nantinya saya memiliki perusahaan sendiri yang dapat membuka banyak lapangan pekerjaan untuk masyarakat sekitar. ',	'Setelah lulus SMA, saya tidak langsung melanjutkan kuliah. Saya mencari pengalaman dengan mengikuti sebuah organisasi bernama BIAS FUTURE LEADER yang berlokasi di Kampung Inggris, Pare, Kediri, Jawa Timur pada tahun 2019-2020 lalu. Organisasi tersebut bergerak di bidang pendidikan. Dalam organisasi tersebut, saya aktif membagikan ilmu saya kepada sesama pejuang SBMPTN secara sukarela. Saya mengajar matematika kepada calon-calon mahasiswa PTN yang juga sedang menjalani masa Gap Year (menunda kuliah) seperti saya. Di dalam organisasi tersebut, saya memangku jabatan inti sebagai sekretaris sehingga posisi saya dalam organisasi tersebut sangatlah penting. Organisasi kami aktif dalam menjalankan event seperti Try Out Akbar, Sosialisasi Persiapan UTBK, dan lain sebagainya. Tujuan utama dalam organisasi ini adalah berkembang bersama untuk mencapai satu tujuan, yaitu lolos menjadi mahasiswa perguruan tinggi negeri. Saya bersyukur, dengan adanya organisasi ini, banyak calon mahasiswa terbantu untuk lolos di perguruan tinggi negeri impiannya. Dan manfaatnya bagi saya yang mengajar dengan sukarela adalah saya dapat menguasai materi UTBK lebih baik sehingga saya pun juga lolos ke PTN yang saya impikan pada tahun 2020 lalu.',	1,	1655562191,	NULL,	0),
('SCHLR-STRBT-14a8d3',	'USR-STRBT-45d7a',	'SITI ROBIATUL ADDEWIYAH',	'2005-03-22',	'85211807015',	'Desa KAMALKUNING kec Krejengan Kab Probolinggo Jawa timur',	'Tadris biologi',	'Universitas Islam negeri  kh.a',	'0.00',	'Maba',	'Saya adalah calon mahasiswa tahun 2022 yang memiliki tujuan menjadikan bangsa Indonesia maju, dengan potensi yang dimiliki mampu menjadi contoh anak remaja saat ini dan saat ini juga tengah mencari pengalaman yang mampu memberikan contoh yang positif lewat kegiatan-kegiatan yang saya ikuti.',	' saya  ingin menjadi salah satu penyemangat atau contoh bagi mereka yang kini tengah putus sekolah karena masalah ekonomi , saya tau bagaimana rasa nya mimpi harus dihentikan hanya karna angka..banyak keluh kesah yang hampir setiap hari didengar ditambah lagi saya  yang berasal dari didaerah terpencil yang minim akan pengetahuan     dengan biasiswa ini memberikan kesempatan  bagi saya untuk membagi pengalaman tentang banyak cara untuk mencapai cita -cita dengan ilmu² yang relevan , lewat pengalam yang telah saya dapatkan, kontribusi yang saya peroleh mereka  tambah makin yakin  dan percaya bahwa mereka dapat mencapai mimpinya',	'.perlombaan yang paling berkesan buat saya adalah itu saya lomba International Invention For Young Moslem Scientists (IICYMS) bagaimana tidak mengesankan Lomba internasional dengan otomatis menggunakan bahasa Inggris dan saya adalah seorang yang tidak bisa menggunakan bahasa Inggris pun dengan niat dan tekad sava mulai belajar sesuatu yang saya tidak suka juga bantuan pola pikir saya yang membuat saya yakin dan mampu mengikuti lomba ini dan berhasil mendapatkan juara gold medal',	1,	1654234606,	NULL,	0),
('SCHLR-STRHM-5332b2',	'USR-STRHM-4ed9c',	'Siti Rohmah Aulia Putri ',	'2005-11-22',	'85771646157',	'Jl.Kh Mas Mansyur RT/RW 04/01 Bekasi Kaum no. 16 dekat kolam renang Grande Tirta ',	'IPS ',	'MA Muhammadiyah 03 Bekasi ',	'8.7',	'2',	'Nama saya Siti Rohmah Aulia Putri, saya senang disapa \'Aulia\'. Saya lahir di Kuningan 22 November 2005, saat ini saya menempuh pendidikan di MA MUHAMMADIYAH 03 BEKASI. Dalam waktu dekat ini skill yang saya miliki, saya aktif dalam olimpiade berbasis online dan berhasil mendapatkan beberapa medali serta piagam dari kejuaraan olimpiade ini. Kontribusi yang saya berikan, saya dapat menyumbangkan prestasi dan kemampuan saya untuk beasiswa ini. Menciptkan hasil yang baik dalam pendidikan, termasuk membagi wawasan luas bersama. Tujuan saya berniat untuk mendaftar program ini besar harapan saya untuk mendapatkan beasiswa, karena saya memiliki prestasi, saya juga memiliki kemampuan dalam bidang pendidikan, oleh karena itu saya mengajukan pendaftaran beasiswa ini untuk meringankan biaya sekolah, keinginan saya untuk belajar sulit disebabkan ekonomi yang tidak begitu mampu.\r\nSaya tinggal dengan keluarga kecil, sejak kecil saya kehilangan ayah. Sedari kecil, saya selalu dinasehati oleh kakek untuk rajin beribadah, menjadi anak yang sholeh, patuh kepada orang tua, dan rela bekerja keras. Kegigihan meraih prestasi tidak membuat saya padam meskipun saya kehilangan sosok ayah, saya tetap berusaha untuk membanggakan keluarga.\r\n\r\nKelebihan dan Kekurangan saya menurut teman-teman, saya orang yang percaya diri, orang yang penuh semangat, saya tipikal orang yang rapi dalam bekerja, dan saya juga tipe orang yang senang berbaur melakukan komunikasi ke orang banyak. Kekurangan saya, cepat mengambil tindakan, saya orang yang selalu mengkritik diri sendiri dan terlalu sensitif.',	'Mimpi terbesar dalam hidup saya, saya ingin menjadi orang yang berhasil, saya ingin mendapatkan mimpi saya setimpal dengan perjuangan saya, dan cara yang saya wujudkan, saya bisa mengikuti olimpiade berbasis online dan alhamdulilah saya pernah mendapatkan beberapa juara di bidang tertentu, saya juga mengikuti program pendidikan di lembaga online lainnya tentu nya sesuai dengan kemampuan saya dan saya mampu itu.',	'Iya, saya pernah lolos menjadi brand ambassador di Maju. idn dan saya sendiri pernah mengikuti program studi kasus di Yayasan API Pengabdi Muda Indonesia, saya alhamdulilah lolos dengan cara mengisi berkas studi program di Papua Barat, saya bangga jawaban saya bisa masuk kedalam kategori \"25 jawaban terbaik\" sehingga saya bisa lolos dalam organisasi program tersebut walaupun saya belum bisa mengambil kesempatan untuk melaksanakan program langsung dikarenakan saya tidak mempunyai biaya nya.',	1,	1655369171,	NULL,	0),
('SCHLR-STRRS-a33e6e',	'USR-STRRS-53f9f',	'Astri Arsi Ismail',	'2002-10-03',	'82213257142',	'Luwu, Sulawesi Selatan',	'Sastra Inggris',	'Universitas Muslim Indonesia',	'3.72',	'4',	'Saya adalah seorang mahasiswa yang selalu termotivasi untuk mengembangkan diri. Yaitu dengan mempelajari skill skill terbaru yang nantinya akan menunjang karir baik itu soft skill maupun hardskill. Saya juga tertarik dalam bidang akademik, hal itu dibuktikan dengan GPA yang saya dapatkan, selain itu saat saya diterima pertukaran mahasiswa, saya mengambil beragam mata kuliah diluar prodi saya dan berhasil mendapat GPA 3.95. Pencapaian tersebut membuat saya tambah yakin bahwa saya suka mempelajari hal baru dan akan berusaha untuk melakukan yang terbaik dalam bidang yang diminati. Saat ini saya sibuk dengan kuliah juga komunitas Alumni Kampus Merdeka Bergerak, dimana kami mengabdikan diri terhadap pendidikan di Indonesia sesuai dengan program dari kemendikbud yang menyuarakan merdeka belajar dikalangan mahasiswa maupun pelajar lainnya. Akhir akhir saya juga senang mempelajari desain yang mana saya tidak punya latar belakang desain, tapi saya pikir desain merupakan skill yang sangat penting untuk dimiliki. Kecintaan saya akan hal hal baru tidak berhenti sampai disitu, saya juga suka membaca buku mengenai self improvement, dan buku buku genre lain yang memberi saya pengetahuan baru.',	'Mimpi terbesar saya ialah berkontribusi terhadap pendidikan di Indonesia. Hal itu dapat saya wujudkan dari sendiri dahulu. Saya harus memantapkan kualitas diri, mencari banyak pengalaman dan pengetahuan sehingga bisa melihat permasalahan pendidikan kita dari segala aspek dan membangun relasi yang luas. Kontribusi saya terhadap tujuan ini juga sudah mulai melalui komunitas Alumni Kampus Merdeka Bergeral yang ikut menyuarakan merdeka belajar. Saya juga mempunyai mimpi untuk menimba ilmu di luar negeri, oleh karena itu saya mulai melakukan persiapan dengan mencari informasi universitas, beasiswa, dan hal lain yang bersangkutan.',	'Saat SMA saya gabung organisasi Paskibraka tingkat provinsi Sulawesi Selatan. Disini kami dilatih sikap kepemimpinan dan rasa cinta tanah air. Saat kuliah saya bergabung dengan komunitas Alumni Kampus Merdeka Bergerang. Mengusung program yang diciptakan oleh Bapak Nadiem Makarim mengenai merdeka belajar, kami mendedikasikan ilmu dan pengalaman kami terhadap mahasiswa lainnya dan memberi motivasi serta informasi mengenia program kampus merdeka.',	1,	1655385554,	NULL,	0),
('SCHLR-STRRS-ea79d0',	'USR-STRRS-53f9f',	'Astri Arsi Ismail',	'2002-10-03',	'82213257142',	'Luwu, Sulawesi Selatan',	'Sastra Inggris',	'Universitas Muslim Indonesia',	'3.72',	'4',	'Saya adalah seorang mahasiswa yang selalu termotivasi untuk mengembangkan diri. Yaitu dengan mempelajari skill skill terbaru yang nantinya akan menunjang karir baik itu soft skill maupun hardskill. Saya juga tertarik dalam bidang akademik, hal itu dibuktikan dengan GPA yang saya dapatkan, selain itu saat saya diterima pertukaran mahasiswa, saya mengambil beragam mata kuliah diluar prodi saya dan berhasil mendapat GPA 3.95. Pencapaian tersebut membuat saya tambah yakin bahwa saya suka mempelajari hal baru dan akan berusaha untuk melakukan yang terbaik dalam bidang yang diminati. Saat ini saya sibuk dengan kuliah juga komunitas Alumni Kampus Merdeka Bergerak, dimana kami mengabdikan diri terhadap pendidikan di Indonesia sesuai dengan program dari kemendikbud yang menyuarakan merdeka belajar dikalangan mahasiswa maupun pelajar lainnya. Akhir akhir saya juga senang mempelajari desain yang mana saya tidak punya latar belakang desain, tapi saya pikir desain merupakan skill yang sangat penting untuk dimiliki. Kecintaan saya akan hal hal baru tidak berhenti sampai disitu, saya juga suka membaca buku mengenai self improvement, dan buku buku genre lain yang memberi saya pengetahuan baru.',	'Mimpi terbesar saya ialah berkontribusi terhadap pendidikan di Indonesia. Hal itu dapat saya wujudkan dari sendiri dahulu. Saya harus memantapkan kualitas diri, mencari banyak pengalaman dan pengetahuan sehingga bisa melihat permasalahan pendidikan kita dari segala aspek dan membangun relasi yang luas. Kontribusi saya terhadap tujuan ini juga sudah mulai melalui komunitas Alumni Kampus Merdeka Bergeral yang ikut menyuarakan merdeka belajar. Saya juga mempunyai mimpi untuk menimba ilmu di luar negeri, oleh karena itu saya mulai melakukan persiapan dengan mencari informasi universitas, beasiswa, dan hal lain yang bersangkutan.',	'Saat SMA saya gabung organisasi Paskibraka tingkat provinsi Sulawesi Selatan. Disini kami dilatih sikap kepemimpinan dan rasa cinta tanah air. Saat kuliah saya bergabung dengan komunitas Alumni Kampus Merdeka Bergerang. Mengusung program yang diciptakan oleh Bapak Nadiem Makarim mengenai merdeka belajar, kami mendedikasikan ilmu dan pengalaman kami terhadap mahasiswa lainnya dan memberi motivasi serta informasi mengenia program kampus merdeka.',	1,	1655383674,	NULL,	0),
('SCHLR-STRYP-b9ec09',	'USR-STRYP-dd7e1',	'Estuary Perjuangan Try Putra Maruao',	'2002-11-21',	'82285898095',	'Seberang Padang Utara 2, Padang selatan',	'Jurusan Keperawatan Fakultas k',	'Universitas Andalas',	'3.82',	'2',	'saya orangnya mudah berbaur denga siapa saja tak peduli Ras ataupun dari latar belakang seperti apa. bertanggung jawab dan dapat di percaya. Berjiwa kepemimpinan',	'mimpi terbesar saya adalah tercapainya cita-cita saya sebagai seorang perawat dan sangat ingin membanggakan kedua orang tua saya dan ingin membuat mereka bangga bahwa saya dapat melebihi batasan diri saya. untuk mencapai itu semua saya lakukan dengan belajar dengan baik,  baik di perkuiahan maupun di luar perkuliahan. ',	'Ya, saya punya pengalaman organisasi dan sangat sering mengikuti kegiatan-kegiatan yang ada dan mengambil peran di dalamya seperti mejadi panitia. untuk saat ini saya mengikuti organisasi di fakultas saya yaitu DPM KM Fkep. dimana saya sabagai ketua umumnya dan saya di bantu oleh rekan-rekan saya dan organisasi lainnya untuk terus berkontribusi memajukan fakultas keperawatan universitas andalas baik secara akademik maupun non akademik, baik secara fakultas maupun universitas.',	1,	1653762530,	NULL,	0),
('SCHLR-STSLW-da81e7',	'USR-STSLW-bb285',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1653706516,	NULL,	0),
('SCHLR-STSRR-cb4524',	'USR-STSRR-e67e8',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655658394,	NULL,	0),
('SCHLR-STVNM-3078bc',	'USR-STVNM-42899',	'Stevani M Kale Dipa',	'2002-04-15',	'81213104351',	'Kelurahan Oepura, Kecamatan Maulafa, Kota Kupang.',	'FISIP Ilmu Komunikasi',	'Universitas 17 Agustus 1945 Su',	'3.40',	'4',	'Saya adalah seorang mahasiswi semester 4 jurusan Ilmu Komunikasi. Pengalaman pertama saya berbicara di depan umum adalah sejak saya SD. Saya mengikuti lomba yang berbaur dengan literasi yaitu membaca puisi, membaca pidato. Dan itu berlanjut sampai saya SMA. Puji Tuhan saya selalu masuk 3 besar ketika mengikuti lomba-lomba tersebut.',	'Mimpi terbesar saya adalah menjadi seorang penyiar berita di salah satu stasiun Tv. Untuk mewujudkannya, saya mengikuti berbagai event yang berhubungan dengan public speaking agar melatih cara saya berbicara. Saya juga mengikuti event membaca berita, mengikuti pemilihan Duta.\r\nSaya juga ingin membuat keluarga saya bangga, oleh karena itu saya akan terus belajar dan menjadi orang yang bermanfaat dan berprestasi.\r\nSaya ingin menanggung biaya kuliah saya dan adik sepupu saya karena saya tahu orang tuanya tidak mampu untuk membiayai. Itulah kenapa saya mendaftar beasiswa ini.',	'Saya pernah menjadi anggota Sanggar Badansa yang diadakan di SMA. Sanggar Badansa adalah tempat dimana kami mengasah skill yang ada dalam diri kami mengenai literasi. Saya mulai dibentuk dengan baik sehingga cara saya berbicara sudah cukup membaik hingga saat ini.',	1,	1655537134,	NULL,	0),
('SCHLR-STVNS-468097',	'USR-STVNS-5c486',	'STEVEN SEVENTINO SIMANJUNTAK',	'2004-10-17',	'81262873431',	'JL.SUMBER JAYA 2',	'TEKNIK INFORMATIKA',	'BRAWIJAYA',	'3.98',	'1',	'Perkenalkan saya Steven seventino simanjuntak tinggal di Kota Pematangsiantar,lahir pada tanggal 17 Oktober 2004.Saya sekola di SMA dengan jurusan IPA dengan nilai akademik yang baik dimana saya memiliki cita-cita kuliah dibidang Teknik informatika.\r\n\r\nKondisi ekonomi  keluarga saya cukup berat karena orangtua saya harus membiayai adik saya yang bersekolah di sekolah swasta,oleh karena itu untuk meringankan beban orangtua saya berharap dapat memperoleh beasiswa ini.\r\n\r\nsaya dalam hal akademik memiliki prestasi dimana pada tahun 2019 saya dapat masuk kesekolah favorit yang ada di kota saya dan saya berhasil menjadi juara umum ketika saya duduk di bangku SMP.dan saya sangat suka dengan perhitungan olleh karena itu saya mengambil jurusan teknik informatika dimana dijurusan tersebut banyak sekali berhubungan dengan matematika.\r\n\r\nHarapan saya dapat meringankan beban orangtua dalam hal biaya kuliah dan menjadi kebanggaan orangtua\r\n\r\nSaat ini kita tau bidang teknologi sangat berkembang dengan pesat dan juga ada banyak aplikasi,web,dan game yang sering kita gunakan dalam kehidupan sehari-hari maka dari itu saya ingin mengambil bagian dalam perkembangan teknologi dan membantu masyarakat dengan ilmu yang saya miliki nanti',	'Mimpi terbesar saya adalah menjadi orang yang dapat membantu semua orang baik dalam membuat banyak  lapangan pekerjaan dan juga memberi makan banyak orang setidaknya untuk mengurangi angka kemiskinan yang ada di negara saya dengan demikian say adengan mantap mewujudkan impian tersebut dengan cara mendirikan perusahaan teknologi  yang bergerak dibidang layanan.dengan demikian dengan  banyaknya cabang yang saya dirikan maka saya secara tidak  langsung dapat menyerap tenaga kerja yang ada di daerah tersebut',	'saya memiliki pengalaman organisasi ,sewaktu duduk di bangku SMA saya pernah menjadi ketua organisasi keagamaan,ketika menjabat sebagai ketua saya mendapatkan banyak pengalamam yang saya rasa dapat membantu saya untuk berkembang pada jenjang selanjutnnya',	1,	1654233224,	NULL,	0),
('SCHLR-STYSY-880521',	'USR-STYSY-0f063',	'Souty Syahrani',	'2002-03-26',	'81277725446',	'Jln. Moh. Hatta No.35, Pasar Baru, Pauh, Cupak Tangah, Padang, Sumatra Barat',	'Sastra Inggris/Fakultas Ilmu B',	'Universitas Andalas',	'3.89',	'4',	'Saya adalah seorang pekerja keras, bertanggung jawab, open minded dan selalu ingin mempelajari hal-hal baru. Disamping fokus dengan dunia perkuliahan atau akademik dengan IPK terbaru 3.89, saya juga suka memperkaya pengetahuan, pengalaman serta relasi dengan aktif di 4 organisasi, yakni UKPM Genta Andalas, yang bergerak dalam bidang Jurnalistik dan kepenulisan, Hima Jurusan ESA (English Students Association), IPMB-Sumbar (Ikatan Pelajar Mahasiswa Batam Sumatra Barat), dan Aruna (Akademi Relawan Unand). Selain aktif berorganisasi, saya juga suka meluangkan waktu saya untuk menulis dan melakukan kegiatan kerelawanan terutama dalam bidang pendidikan, dimana sejak pandemi hingga kini, saya menjadi tutor online bahasa Inggris dan mengajar tiap hari Sabtu atau Minggu. Selain itu melalui Aruna (Akademi Relawan Unand), saya juga dapat turut aktif dan terjun langsung ke lapangan dalam kegiatan sosial kerelawanan lainnya, seperti baksos ke panti asuhan, bagi-bagi takjil, mengajar ke sekolah dan lainnya. ',	'Mimpi terbesar saya adalah membahagiakan dan membuat kedua orang tua saya bangga dengan mendapat beasiswa untuk melanjutkan studi ke luar negeri, dan membangun sebuah kursus dan yayasan pendidikan di dalam negeri. Maka cara saya untuk mewujudkannya adalah dengan giat, tekun dan bekerja keras dalam meraih prestasi, ilmu dan pengalaman baik di bidang akademik dan non-akademik. Kemudian untuk meraih itu, saya akan bekerja keras dan memanage waktu saya sebaik mungkin, dan dengan melamar beasiswa, saya harap dapat menjadi jembatan dan dorongan bagi saya untuk semangat berprestasi dan mewujudkan mimpi saya tersebut.',	'Ya, cukup banyak pengalaman saya di kerelawanan dan organisasi. Di awal perkuliahan, pada masa pandemi, saya aktif mengikuti kegiatan volunteer sebagai brand ambassador di beberapa platform, seperti VEA (Virtual Education Academy), komunitas pendidikan Bonapasogit Mengajar, dan TRUMUN (Trunojoyo Model United Nations), serta intern sebagai Brand Ambassador di Lokpro (Loker Programmer). Saat menjadi Brand Ambassador saya menjadi lebih tertantang untuk berbicara dengan luwes di depan publik, dan mengasah skill saya dalam editing dan designing. Kemudian saya juga aktif menjadi volunteer dalam dunia pendidikan, yang mana bahkan saya, mahasiswi Sastra Inggris menjadi relawan pembuat chatbot pendidikan Bahasa Inggris, dengan mempelajari coding atau programming selama 1 bulan. Chatbot saya beserta tim yang bernama LEAH (Learn English with Hannah) kini dapat digunakan oleh khalayak umum dan gratis. Saya juga aktif menjadi tutor bahasa Inggris secara online dengan mengajar melalui zoom di StudyProject dan hingga kini di platform edufriend.id.  Saya mengajari 2 siswa SD kelas 4 tiap hari sabtu dalam seminggu. Ini menjadi salah satu pengalaman luar biasa bagi saya, walau kami hanya bertemu via zoom, tapi saya memiliki keluarga baru, saya berkomunikasi dengan baik dengan kedua keluarga siswa saya hingga kini. Kemudian setelah kuliah mulai offline, kini saya juga mulai aktif berorganisasi di kampus, dimana saya mencoba mengasah skill kepenulisan saya dengan bergabung sebagai calon anggota di UKPM (Unit Kegiatan Pers Mahasiswa) Genta Andalas. Di organisasi ini, saya belajar menulis sesuai kaidah bahasa dengan benar, mempelajari jenis-jenis berita, mempelajari tata cara menjadi wartawan, serta tentunya update dengan berita di lingkungan kampus. Bahkan kini saya sudah banyak mewawancarai petinggi-petinggi kampus Unand, mulai dari dosen, dekan, wakil dekan, bahkan wakil rektor. Beberapa tulisan saya juga telah di upload di official resmi UKPM Genta Andalas. Selain itu, dengan tetap menjaga relasi dengan kakak tingkat di jurusan dan memajukan jurusan, saya juga bergabung menjadi pengurus di divisi minat bakat di ESA (English Students Association). Kemudian dengan menjaga relasi dengan seluruh mahasiswa asal Kota Batam di Sumatra Barat, saya juga aktif menjadi pengurus di departemen kominfo di IPMB Sumbar. Di IPMB Sumbar, saya juga meningkatkan skill basic design saya. Selain itu, sebagaimana saya tertarik dengan dunia kerelawanan, kini saya juga aktif di Aruna (Akademi Relawan Unand), dimana saya mengikuti berbagai kegiatan sosial yang diadakan BEM KM Unand, terutama kementrian Sosial Masyarakat. Melalui Aruna, saya banyak memiliki pengalaman kerelawanan, diantaranya saat bulan Ramadhan lalu, kami mengadakan bakti sosial di sebuah panti asuhan di daerah Kota Padang, disana saya berinteraksi dan mengajar adik-adik panti asuhan. Kemudian, kami juga melakukan aksi bagi-bagi takjil di jalanan di Kota Padang. Serta yang terbaru, dalam kegiatan Andalas Mengedukasi, saya menjadi MC dan salah satu pengajar bahasa Inggris di sebuah SD di daerah terpencil, yakni SD Bustanul Ulum di Batu Busuk.',	1,	1655659842,	NULL,	0),
('SCHLR-STZHR-83c7b7',	'USR-STZHR-e37fb',	'Siti Zahroh',	'2005-05-29',	'895415558197',	'Desa Kuwasen RT 06/02 Kecamatan Jepara Kabupaten Jepara Provinsi Jawa Tengah',	'MIPA',	'SMAN 1 Jepara',	'8.86',	'4',	'Nama saya Siti Zahroh, umur saya 17 Tahun dan saya adalah siswa kelas 11 SMAN 1 Jepara. Saya adalah siswa yang aktif di bidang akademik maupun non akademik. Saya pernah meraih medali emas, perak maupun perunggu dalam beberapa Olimpiade bidang PPKN tingkat Nasional. Saya aktif dalam organisasi sekolah maupun luar sekolah. Selain itu saya juga aktif dalam mengikuti event di luar maupun dalam sekolah dan beberapa kali saya diberi kesempatan untuk menjadi panitia event ataupun menjadi ketua panitia nya. Walaupun saya aktif di banyak organisasi namun akademik tetap menjadi prioritas saya sebagai bentuk tanggung jawab saya sebagai pelajar. Saya adalah orang dengan tipe extrovert. Saya senang berkomunikasi dan berinteraksi dengan orang lain. Saya senang berbagi pengalaman dengan orang baru dan belajar banyak hal dari mereka. Hobi saya bermain gitar dan membaca buku. Bermain musik membuat waktu luang saya dapat saya nikmati, dan itu bagian dari bakat saya. Sedangkan untuk buku, saya lebih suka buku dengan tema self improvement, dan filsafat. Dan dengan membaca buku self improvement, saya dapat mengubah pola hidup saya yang negatif menjadi positif, memperbaiki dan membangun karakter saya sehingga saya dapat menjadi pribadi yang lebih baik, dan dengan buku filsafat  saya dapat menambah pengetahuan saya lebih dalam mengenai hal hal yang sebelumnya saya tidak tahu. Saya adalah pekerja keras, tidak mudah menyerah dan berani. Saya aktif menyuarakan isu isu tentang hak hak anak dan perempuan. Karena anak dan perempuan rentan terkena kekerasan, diskriminasi dan pelecehan',	'Saya ingin menjadi aktivis hukum dan HAM. Dan saya ingin memulai perjalanan saya dengan menjadi mahasiswa Fakultas Hukum. Saya tahu untuk mewujudkannya bukanlah hal yang mudah. Tetapi hal itu tidak membuat saya menyerah. Saya mencari cara supaya saya bisa menemui mimpi saya. Saya mulai mengikuti olimpiade bidang PPKN tingkat Nasional dan berhasil membawa pulang medali emas, perak maupun perunggu. Dan dari olimpiade tersebut tentunya dapat memberikan saya wawasan tentang hukum. Saya juga mencoba mengikuti beberapa pelatihan soft skill yang dapat meningkatkan kemampuan saya dalam public speaking. Saya mengikuti lomba lomba lain yang dapat membawa saya dekat dengan mimpi saya dan memberikan saya wawasan tentang hukum',	'Iya, saya menjadi pengurus MPK SMAN 1 Jepara, menjadi Kepala Bidang Humas Dewan Ambalan Pramuka SMAN 1 Jepara, Administrator Dana Usaha kepanitiaan GeKAES SMAN 1 Jepara, Kepala Bidang Informasi Divisi Komunikasi Forum Anak Jepara (2021- sekarang) , Divisi IT Forum Anak Jepara (2019-2021), divisi fundraiser StartUp Youth Indonesia (2021), divisi sponsorship StartUp Youth Indonesia (2022), Brand Ambassador Indonesia Event. Saya juga aktif mengikuti webinar dan juga pelatihan soft skill seperti menjadi peserta dalam Yogyakarta Kindness Conference, Setelah Sekolah Student Summit, National Development Rebrand, Lead the Fest, FMBPI, Indonesia Butuh Anak Muda, dll. Saya pernah menjadi delegasi Kabupaten Jepara dalam CHAMPION 2P bersama Menteri PPPA RI, dan menjadi delegasi Kabupaten Jepara dalam pertemuan Forum Anak Provinsi di Semarang. Saya juga pernah berkesempatan menjadi mentor dalam acara SYILC 2021',	1,	1655041450,	NULL,	0),
('SCHLR-STZR-1feccc',	'USR-STZR-5dd7a8',	'Siti Azura',	'2001-08-27',	'895619709933',	'Batu Bara, Sumatra Utara',	'S1 Sastra Inggris/Ilmu budaya',	'Universitas Sumatera Utara',	'3.20',	'4',	'Saya Siti Azura, mahasiswi semester 4 jurusan Sastra Inggris di Universitas Sumatera Utara. Saya sangat tertarik dengan bidang public speaking, leadership, pendidikan, dan pengembangan sumber daya manusia. Kemampuan lain yang saya miliki adalah saya dapat memimpin, beradaptasi, bekerja sama dalam tim, dan memecahkan masalah yang dapat saya bawa untuk berkontribusi dan berdampak positif bagi lingkungan dan profesi yang saya geluti nantinya. Saya pernah mengikuti AFL dan menjadi peserta aktif hingga saat ini. Saya memiliki bakat dan minat dalam hal menulis. Dan terakhir Bahasa yang saya kuasai adalah Bahasa Indonesia native dan Bahasa Inggis dasar. ',	'Mimpi terbesar saya adalah saya ingin memiliki hidup yang bermanfaat bagi orang banyak dan cara saya mewujudkan nya adalah dengan mengikuti banyak kegiatan volunteer, kegiatan pelatihan soft skill, dan ikut serta dalam komunitas pengembangan sumber saya manusia. Saya juga bermimpi bisa mengabdi di sebuah sekolah terpencil yang dimana anak-anak memiliki mimpi besar untuk belajar dan menjadi generasi yang cerdas. Saya harap kegiatan-kegiatan yang saya ingin ikuti bisa membantu saya meraih mimpi besar itu.',	'Saya pernah menjadi pengurus Osis dan UKS semasa SMA. Dan kini saya mengikuti kegiatan  AIESEC Future Leader.',	1,	1654058570,	NULL,	0),
('SCHLR-SYCHB-eb8bfe',	'USR-SYCHB-c0714',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1653664677,	NULL,	0),
('SCHLR-SYHKT-c71c69',	'USR-SYHKT-b9f33',	'Aisyah Okta Ro\'idatulliyana ',	'2002-10-18',	'81334273374',	'Tawangrejo Pandaan Pasuruan JATIM ',	'Peternakan ',	'Universitas Brawijaya ',	'3.5',	'2',	'Saya adalah seorang mahasiswi dengan latar belakang keluarga yang sederhana. Dari kesederhanaan tersebut saya dilatih untuk menjadi manusia yang mandiri dan mampu berjalan dalam keadaan tekanan sekalipun. Dari kebiasaan tersebut menjadikan saya terbiasa untuk senantiasa semangat dalam meraih impian demi mewujudkan masa depan yang lebih baik untuk bisa mengangkat derajat orangtua dan keluarga.\r\nTerimakasih ',	'Mimpi terbesar saya adalah menjadi seorang pengusaha ternak yang dermawan dan bermanfaat. Saya ingin mewujudkan kondisi peternakan dengan pakan yang berkualitas dan berkelanjutan, karena melihat kondisi peternak masyarakat hingga saat ini masih banyak yang kurang efisien, terutama pada persoalan pakannya. Saya ingin mengembangkan pakan alternatif bernutrisi tinggi dengan ketersediaan nya yang mencukupi dan juga terjangkau.\r\nTerimakasih ',	'Iya. Di masa yang tergolong Maba saat ini, Saya mengikuti kepanitiaan pada perlombaan KTI (Karya Tulis Ilmiah) dengan menjadi Devisi konsumsi, disini saya bertanggungjawab untuk menyusun anggaran konsumsi dan menyediakan makanan yang sesuai untuk panitia, dosen, dan juri. Selain itu saya juga aktif ikut serta dalam organisasi pada UKM Basketball Brawijaya dengan menjadi sekertaris, pada posisi ini saya telah melaksanakan laporan kegiatan rapat rutin bulanan dan juga surat menyurat. Selain itu saya juga dipercaya untuk menjadi Bendahara pada salah satu proker UKM karya ilmiah, dan menjadi Humas pada kegiatan PESG (Pelatihan Edukasi Sensitif Gender).\r\nTerimakasih ',	1,	1655116729,	NULL,	0),
('SCHLR-SYKRY-346c67',	'USR-SYKRY-28a0e',	'Syukriyatul Aini',	'2002-02-25',	'81998953415',	'Perumahan Mawar Asri No 5E Rosepamatan Blega Kabupaten Bangkalan',	'Akuntansi',	'Politeknik Negeri Malang',	'3.53',	'4',	'Nama saya Syukriyatul Aini dan saya berkuliah di Politeknik Negeri Malang. Saya mengambil jurusan Akuntansi tepatnya program studi D4 Keuangan. Saya memiliki nilai IPK 3.52 selama berkuliah di politeknik negeri malang selama sampai di semester 4 ini.\r\nSaya Saat kuliah, saya pernah magang kerja di digital marketing perusahaan myskill.id dan linimuda inspirasi selama 4 bulan. Disana saya membantu tim rekrutmen untuk posisi tenaga penjualan. Dari pengalaman singkat tersebut, saya memahami peran dan nilai yang diciptakan tim perekrut dan bagaimana mereka memastikan perusahaan selalu merekrut talenta terbaik. Serta bagaimana mendapatkan keuntungan perusahaan yang tinggi dalam strategi penjualan produk. Saya juga aktiv di beberapa organisasi eksternal dan internal kampus, dan juga beberapa kali menjuarai ajang lomba. Saya memiliki target target dalam hidup saya, jadi saya adalah orang yang ambisius untuk mendapatkan target-target dalam kehidupan saya tersebut.',	'Mimpi terbesar saya adalah mewujudkan semua cita-cita dan harapan saya nanti, salah satunya yakni dapat bekerja di perusahaan BUMN jika nanti telah lulus dari Politeknik Negeri Malang, dan dapat bermanfaat bagi orang lain dan keluarga besar saya. Melanjutkan studi yang lebih tinggi lagi setelah lulus dari Politeknik Negeri Malang. Serta mimpi terbesar lainnya adalah saya dapat mengangkat derajat kedua orang tua saya dan dapa membanggakan meraka. ',	'Saya memiliki pengalaman baik dari segi organisasi, magang dan kegiatan relawan baik dari internal dan eksternal kampus. Misalnya saja pengalaman saya selama kuliah dapat dikategorikan sebagai berikut:\r\nOrganisasi Di Dalam Kampus\r\n1. Himpunan Mahasiswa Akuntansi Sebagai Staff Ahli Bidang Kewirausahaan\r\n2. Unit Kegiatan Mahasiswa Pendidikan dan Penalaran Sebagai Ketua Subidang Penelitian Ilmiah\r\nOrganisasi Di Luar Kampus\r\n1. Yes Study Indonesia Sebagai Ambassador\r\nKepanitiaan\r\n1.  Polinema Mengajar\r\n2. Pemilihan Raya Politeknik Negeri Malang \r\n3.  National Accounting Seminar And Debate Competition Season 3\r\n4. Accounting Skill and English Competition (ASEC) 2021\r\n5. Karya Ilmiah Mahasiswa\r\n6. Techo Fair and Seminar \r\n7. Penelitian Ilmiah 2021\r\n8. Try Out Seleksi Bersama Masuk Politeknik Negeri 2021\r\n9. Business Contest Competition 2021\r\n10. Volunteer Anti Bullying Campaign\r\n11. Volunteer Mental Health Resolution 2021\r\n12. Internship Lini Muda',	1,	1654661136,	NULL,	0),
('SCHLR-SYMHN-a3902b',	'USR-SYMHN-a1d68',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654061044,	NULL,	0),
('SCHLR-SYRFT-ecee6c',	'USR-SYRFT-d6ad8',	'Syarifatun Ni\'mah',	'2001-10-07',	'85730284147',	'rt02/rw01 Jatipurus, Poncowarno, Kebumen, Jawa Tengah',	'Ekonomi Syariah',	'Universitas Alma Ata',	'3.82',	'2',	'Mahasiswa Ekonomi yang antusias dan bermotivasi tinggi dengan kemampuan kepemimpinan, bertanggung jawab, inisiatif, dan mencari tantangan baru. Berpengalaman dalam proses pendataan masyarakat baik secara langsung maupun virtual. Memiliki komunikasi lisan dan verbal yang baik serta mahir dalam mengoperasikan komputer.',	'Bekerja diperusahaan besar di Indonesia. Dengan mengikuti program beasiswa ini menjadi jalan salah satunya karena saya yakin program ini yan saya butuhkan nanti dimasa mendatang. Begitu bannyak kegiatan positif yang nantinya sebagai bekal saya dalam menghadapi dunia kerja.',	'Saya memang belum pernah memiliki pengalaman secara keseluruhan tapi saya pernah membantu teman/saudara dalam melakukan penelitian. ',	1,	1655694475,	NULL,	0),
('SCHLR-TFQSM-b85bfa',	'USR-TFQSM-d69a7',	'Taufiq Ismail ',	'2004-01-31',	'81311478298',	'Dsn.kruwul RT.04 RW.01 DS.sukoanyar kec.turi kab.lamongan',	'Pendidikan Teknik Elektro ',	'Universitas Negeri Surabaya ',	'8.5',	'1',	'Saya Taufiq Ismail, Mahasiswa baru di Universitas Negeri Surabaya dengan Prodi Pendidikan Teknik Elektro.\r\nSaya ahli dalam membuat robot dengan sistem IOT dan sensor. Ahli pada bidang pembuatan Amplifier dan Power Rakitan.\r\nSaat SMK, saya adalah pelajar dengan predikat Magang Terbaik sewaktu PKL (praktek kerja lapangan) di PT.PETRONIKA GRESIK.\r\nSaya juga aktif dalam paskibra, bahkan pernah meraih juara utama 1 dan umum.',	'Mimpi terbesarku adalah ingin menjadi seorang guru.cara saya untuk mewujudkannya adalah belajar dengan rajin tetap semangat walaupun ada banyak rintangan,selalu mengikuti event perlombaan ',	'Saya mempunyai pengalaman organisasi OSIS dan paskibraka. Di OSIS saya pernah menjadi panitia dalam acara perlombaan olahraga tingkat SMP yang bermanfaat bagi kepentingan sekolah. Sedangkan di paskibraka saya mengikuti berbagai perlombaan hingga meraih Juara Utama 1dan Juara Umum.\r\nSelain itu, saya juga aktif menjadi relawan yang sering membantu guru mengajari adik kelas dalam mapel mikrokontroler dan bahasa pemrograman.',	1,	1654834767,	NULL,	0),
('SCHLR-TGRDT-c99365',	'USR-TGRDT-b55a4',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655735778,	NULL,	0),
('SCHLR-THFRR-1cef3d',	'USR-THFRR-abb52',	'Thaifur Rahman',	'1998-10-21',	'82338887915',	'Angsanah Bragung, Guluk-Guluk, Sumenep, Madura. ',	'Komunikasi dan Penyiaran Islam',	'Institut Dirosat Islamiyah Al-',	'3.81',	'5',	'Saya adalah seorang mahasiswa dari desa yang penuh catatan sejarah (Bragung). Selain itu, passion saya menulis, travelling, dan selalu ingin mewarnai dunia dengan hal baru berupa pengalaman ke luar negeri. Karena saya ingin membuktikan kepada Indonesia bahwa mahasiswa dari desa juga bisa menjadi manusia yang unggul dan berkualitas. ',	'Mimpi yang paling besar adalah lulus di Harvard Univesty untuk S2 nanti. Maka dari itu, melalui program ini, alhamdulillah saya ucapkan. Karena hal ini bisa menjadi wadah bagi saya untuk bisa terjun ke luar negeri agar nantinya juga tidak kaku. ',	'Saat ini, di kampus, saya dipilih menjadi ketua DEMA Fakultas. Alhamdulillah saya dipercaya memimpin teman-teman. Dengan ini, saya juga belajar pengalaman bagaimana seharusnya menjadi pemimpin.',	1,	1654353449,	NULL,	0),
('SCHLR-THTHR-83401c',	'USR-THTHR-f52ac',	'Ath Thaariq Elriefano Alban Wardhana',	'2000-02-20',	'85892180087',	'JALAN SIMPANG KEPUH BLOK A NO 10 RT 002 RW 010 KELURAHAN BANDUNGREJOSARI KECAMATAN SUKUN KODE POS 65148',	'Hukum',	'Universitas Merdeka Malang',	'3.61',	'4',	'Nama saya Ath Thaariq Elriefano Alban Wardhana, biasa dipanggil Ivan. Saya adalah anak pertama dari 6 bersaudara. Tinggal saya di Malang lebih tepatnya di Sukun. Saya sekarang sedang menempuh kuliah di Universitas Merdeka Malang Jurusan Hukum. Hobi saya adalah Photography dan juga Touring, saya terkadang menerima kerja sampingan menjadi photographer di beberapa acara. Ayah saya Kerja di Batam dan Ibu saya bekerja di Malang. ',	'Mimpi terbesar saya adalah menjadi Notaris di Swiss. Karena disatu sisi saya memang ingin menjadi seorang notaris dan juga saya bermimpi ingin tinggal di swiss. Untuk mewujudkannya saya harus giat belajar di perkuliahan saya tentang hukum hukum yang ada untuk menjadi notaris. dan juga tidak lupa membaca buku atau artikel tentang notaris agar ilmu yang didapatkan tidak hanya di perkuliahan saja',	'Iya, sekarang saya sedang mengikuti organisasi yang bernama PMII, PMII adalah Pergerakan Mahasiswa Islam Indonesia. Saya mengikuti organisasi tersebut karena ingin mendapatkan pengalaman dan juga relasi yang akan membantu saya dikala saya lulus nanti',	1,	1654516953,	NULL,	0),
('SCHLR-TMSTR-09fca7',	'USR-TMSTR-878f4',	'TOMI SATRIA',	'2004-08-15',	'82289592363',	'Sindang lunang',	'Teknik otomotif ',	'SMKN AL ANHAR BAYANG',	'3.0',	'1',	'Aku adalah seseorang yang bekerja keras apabila ingin mendapatkan sesuatu aku harus bekerja terlebih dahulu ',	'Ingin menjadi seseorang yg sukses ,dengan belajar dan skolah tinggi²aku menwujutkannya',	'Tidak',	1,	1654965162,	NULL,	0),
('SCHLR-TNGKF-418729',	'USR-TNGKF-1c42d',	'Tengku Faisal rahman ',	'2002-08-19',	'82311313953',	'Jln Kamboja ujung desa Bagan melibur',	'Ilmu Al Qur\'an dan tafsir',	'UIN Sunan Gunung Djati Bandung',	'3.50',	'2',	'Nama Tengku Faisal Rahman saya berasal dari provinsi Riau lebih tepatnya di daerah yg lumayan jauh dari kota besar harus menggunakan akses transportasi darat dan laut dan juga hanya bisa pake motor biasa, saya anak ketiga dari tiga bersaudara dan berasal dari keluarga yang sederhana Alhamdulillah berkecukupan saya sekolah SD dan SMP di kampung halaman saya namun ketiga menginjak sekolah menengah atas saya mencoba untuk memberanikan diri merantau ke tempat orang sekolah dan menuntut ilmu serta mencari pengalaman baru dan lingkungan baru tidak hanya itu saya juga mondok di pesantren untuk menambah relasi saya dalam bidang agama terkhusus Al Qur\'an membuat batin saya terasa lebih berisi dengan hal yang positif setelah tamat dari MAN saya merantau lagi namun kali ini lebih jauh karena melewati berbagai pulau dan kota besar yaitu di jawa barat tepatnya di Karawang kutawaluya desa Sindang karya terkenal dengan padinya walaupun termasuk kampung tapi tidak seperti kampung saya yg masih belum memiliki akses yang cukup baik, disana saya mondok menghafal Al-Qur\'an selama setengah tahun dan pindah mondok lagi ke Bandung hingga awal tahun 2021 lalu saya mendaftar untuk masuk PTN di UIN Sunan Gunung Djati Bandung hingga sekarang.',	'Mimpi terbesar saya adalah bisa bermanfaat bagi orang banyak terutama bagi keluarga saya bisa membahagiakan orang tua dan sukses dunia akhirat, bicara cara bagaimana saya mewujudkannya mungkin sedikit rumit karena setiap waktu akan terasa berbeda setiap harinya ada masa ketika kita bangkit dan jatuh namun pesan dari orang tua saya kejarlah mimpimu dgn kesederhanaan tidak perlu menampakkan apa yang pada dirimu secara berlebihan namun tampakkan kualitas yang ada pada dirimu serta terus berdoa minta pertolongan dan kemudahan kepada sang pemilik segalanya.',	'Pernah, namun beberapa kali saya gagal karena kurangnya tekad dan kemauan, mencoba untuk terus bisa berani mungkin hanya saja saya masih takut dan ragu perlu bimbingan dan dorongan dari teman dan mentor yang baik serta kemauan pada diri saya yg harus lebih yakin bahwa saya bisa.',	1,	1653672643,	NULL,	0),
('SCHLR-TNTRK-d1fb9e',	'USR-TNTRK-72418',	'Tantri Oktaviani',	'2003-10-08',	'82130896276',	'Jl. Cipatik, RT.001/009, Desa Pataruman, Kec. Cihampelas, Kab. Bandung Barat',	'Desain Komunikasi Visual/Fakul',	'Universitas Pendidikan Indones',	'3.77',	'2',	'Nama saya Tantri Oktaviani, saya lahir di Bandung, 8 Oktober 2003. Saat ini saya tinggal bersama kedua orang tua saya di Cipatik, Bandung Barat. Saya merupakan anak ke-tiga dari tiga bersaudara.\r\n\r\nDi masa sekolah, saya mengikuti beberapa kegiatan seperti Organisasi Siswa Intra Sekolah (OSIS) serta West Java Leader\'s Reading Challenge (WJLRC). Saat SMA, saya bergabung ke dalam Pengurus OSIS, disana saya mendapat pengalaman menyelenggarakan acara dan berbagai kegiatan, saya juga turut merancang konsep dan ide kreatif dalam menyelenggarakan acara-acara tersebut.\r\n\r\nSaya merupakan siswa jurusan IPA pada saat SMA. Namun, saya menyadari bahwa saya memiliki minat dalam bidang seni dan desain, sehingga saya ingin masuk kuliah dengan jurusan Desain Komunikasi Visual. Oleh karena itu, saat SBMPTN saya memilih untuk lintas jurusan ke Sosial Humaniora (Soshum) agar bisa mendaftar ke DKV Universitas Pendidikan Indonesia (UPI). Akhirnya saya lolos SBMPTN di DKV UPI dan sekarang saya sudah menginjak semester 2. Alasan saya memilih program studi DKV karena saya ingin bekerja di industri kreatif, saat ini saya tertarik sekaligus hobi di bidang desain grafis dan gambar digital, saya ingin terus mengembangkan kemampuan saya di bidang tersebut. Saat ini saya melakukan internship di Schoolfess Indonesia sebagai graphic designer, saya juga mengikuti Unit Kegiatan Mahasiswa (UKM) Isola Digital Media (IDM) di divisi grafis dan multimedia. Selain itu, saya juga pernah menjadi pemateri dalam webinar desain grafis, serta menjadi juri desain poster dalam acara \"Catha Megalo\" yang diselenggarakan di SMAN 1 Batujajar.',	'Mimpi terbesar saya adalah bekerja di industri kreatif sebagai graphic designer atau illustrator. Untuk mewujudkannya, saya menyusun tujuan dengan langkah demi langkah menuju mimpi tersebut. Langkah-langkah tersebut terdiri dari langkah besar maupun kecil. Langkah besarnya yaitu saya harus berkuliah di salah satu perguruan tinggi negeri terbaik di Indonesia, yang mana hal tersebut membutuhkan usaha yang besar.\r\n\r\nSetelah berhasil lolos, saya harus memanfaatkan potensi yang saya miliki, saya harus terus belajar untuk menjadi lebih baik lagi, saya juga harus disiplin dalam menuntut ilmu dan mengasah kemampuan saya. Selain itu, saya juga harus konsisten untuk melatih kemampuan saya di bidang desain grafis dan ilustrasi. Selanjutnya, saya harus mencoba hal-hal yang dapat membantu pengembangan bakat dan potensi saya dalam bidang tersebut, seperti melakukan internship, mengikuti lomba, bergabung ke dalam sebuah organisasi, dan kegiatan-kegiatan lain yang berhubungan dengan passion saya. Saya berharap, dengan usaha-usaha itulah saya bisa menggapai mimpi saya.',	'Saya memiliki pengalaman internship menjadi seorang graphic designer di Schoolfess Indonesia sejak bulan September 2021 dan masih berlanjut hingga saat ini. Di Schoolfess Indonesia, saya bertugas membuat poster kegiatan-kegiatan yang diselenggarakan Schoolfess, seperti kegiatan self development, open recruitment, webinar, lomba, dan lain-lain. Di Schoolfess, saya belajar bekerja dalam tim serta belajar kepemimpinan. Selain itu, saya juga mengembangkan kedisiplinan serta rasa tanggung jawab saya sebagai bagian dari sebuah pekerjaan.',	1,	1655713914,	NULL,	0),
('SCHLR-TRDWM-74649d',	'USR-TRDWM-4a68d',	'Tri Dewi Mayang Sari',	'2001-04-26',	'85230426585',	'Jl. Aip Mugiman No. 48 Bondowoso',	'Manajemen Fakultas Ekonomi Bis',	'Universitas Jember',	'3.78',	'4',	'saya biasa dipanggil dewi yang merupakan aktivis, karena saya aktif mengikuti organisasi, seperti himpunan mahasiswa jurusan manajemen, himpunan mahasiswa islam, himpunan mahasiswa manajemen indonesia, organisasi sosial, seperti tulang punggu, gerakan mari berbagi, dan laskar pelangi indonesia. selain itu, saya saat ini sedang mulai mengikuti lomba lomba seperti bisnis plan dan karya tulis ilmiah. saya memiliki sifat ingin tau akan marketing, bisnis, dan atmosfer mahasiswa. saya memiliki sifat yang tanggung jawab apabila diamanahkan, jujur, namun terkadang saya menyukai ketegasan dan itu juga terjadi pada diri saya yang tegas dan lugas dalam berkata dan berperilaku',	'mimpi terbesar saya yaitu menjadi CEO. Cara saya mewujudkan mimpi saya yaitu, dengan mengikuti berbagai organisasi untuk meningkatkan relasi dan selalu dalam lingkungan positif sehingga dengan banyaknya organisasi dan teman yang memiliki keragaman cara aktif membuat saya terbangun dan menjadikan saya terus bersemangat untuk bisa seperti merekan atau bahkan dapat melampauinya selain itu, saya juga mengikuti lomba lomba LKTI  dan BP untuk menunjang karir saya karena sebelum saya menjadi CEO saya akan mengabdi terlebih dahulu kepada perusahaan yang sesuai dengan bidang saya lalu saya akan membangun perusahaan sendiri dan akan menciptakan produk- produk sendiri. AMIN',	'1. Gerakan mari berbagi, pengalaman yang saya dapat, mengunjungi panti asuhan, tour school di pelosok desa dan memberikan pembeklan, dan bakti sosial pada desa desa pelosok daerah Bondowoso\r\n2. Laskar Pelangi Indonesia, pengalaman saya, yaitu bakti sosial dengan menyalurkan sembako, pembenahan musholla warga, dan pembagian pakaian dan santunan kepada anak yatimpiatu sekitar daerah atau desa tersebut\r\n3. Kelompok Studi Kewirausahaan Muda, pengalaman saya, yaitu menjadi panitia webinar digital marketing tingkat universitas\r\n4. Himpunan Mahasiswa Jurusan Manajemen, pengalaman saya, yaitu menjadi panitia workshop [ublic speaking, panitia human resaurch, penanggung jawab penilaian kinerja kepengurusan \r\n5. Himpunan Mahasiswa Islam, pengalaman saya, yaitu melakukan sharing sharing yang lebih meningkatkan keaktifan saya berorganisasi dan berkuliah\r\n6. Himpunan Mahasiswa Manajemen Indonesia, pengalaman saya, yaitu menjadi panitia sekertaris MUSWILUB Wilayah IV di Batu, Malang ',	1,	1655690608,	NULL,	0),
('SCHLR-TRDWW-fe7405',	'USR-TRDWW-7531d',	'Tiara Dwi Wulandari',	'2002-07-13',	'85800021784',	'Barepan Wetan RT 07/RW 04, Desa Barepan, Kec. Cawas, Kab. Klaten, Prov. Jawa Tengah',	'IPA Terpadu/Pendidikan IPA/Fak',	'Universitas Negeri Semarang',	'3.72',	'4',	'Nama saya Tiara Dwi Wulandari, saya merupakan mahasiswa semester 4 Jurusan IPA Terpadu UNNES. Skill yang saya miliki adalah public speaking dan menulis. Pengalaman saya dalam public speaking adalah menjadi moderator dan master of ceremony di beberapa acara kampus dan di luar kampus. Selain itu saya aktif mengikuti kompetisi menulis baik sastra maupun non sastra. Saat ini saya telah menerbitkan 2 buku antologi ber-ISBN dan meraih kejuaraan dalam beberapa lomba. ',	'Mimpi terbesar saya adalah menjadi seorang dosen. Hal ini karena dengan saya menjadi dosen saya dapat mewujudkan beberapa cita-cita sekaligus yaitu mengajar; memiliki kesempatan untuk selalu belajar; berkesempatan untuk terus melakukan penelitian dan pengabdian kepada masyarakat; memiliki bekal finansial yang cukup untuk membangun rumah belajar remaja, program pemberdayaan perempuan, dan membangun rumah sakit gratis untuk masyatakat yang membutuhkan. \r\nCara saya untuk mewujudkannya adalah dengan selalu meningkatkan kemampuan dalam bidang akademik maupun non akademik. Saya berusaha semaksimal mungkin untuk meningkatkan prestasi akademik dalam perkuliahan dengan mendapatkan IPK cumlaude, menjadi mahasiswa aktifitas, dan memiliki wawasan yang luas. Dalam bidang non akademik saya selalu mengikuti berbagai lomba utamanya lomba karya tulis ilmiah dan mendapatkan berbagai kejuaraankejuaraan (saat ini saya mendapatkan 12 kejuaraan tingkat nasional) diantaranya yaitu juara 1 Lomba Esai Al Furqon Universitas Darussalam Gontor 2022, Juara lomba 2 Lomba Esai Kartini Return Guslat MIPA Universitas Negeri Semarang 2022, Juara 3 Lomba Esai Animal Science Festival Universitas Brawijaya 2022. Saya juga mengikuti Training E-commerce & Bahasa Mandarin kerja sama antara Universitas Negeri Semarang dengan Jiangsu Vocational Institute of Commerce pada tahun 2022. Melalui usaha-usaha tersebut saya mendapatkan wawasan baru, mengupgrade diri, meningkatkan kualitas dan kapabilitas diri, serta mempertajam soft skill dalam berbagai hal. Sehingga apabila lulus kuliah nanti saya memiliki bekal pengetahuan dan keterampilan yang siap menunjang tercapainya cita-cita saya. ',	'Pengalaman organisasi yang saya miliki adalah menjadi\r\n1. Staff Departemen Kemakmuran Masjid Forum Mahasiswa Islam FMIPA UNNES tahun 2021\r\n2. Staff Departemen Pembinaan, Pengkaderan, dan Pengembangan Muslim Organization of Integrated Science tahun 2021\r\n3. Ketua Departemen Riset Pengembangan Keilmuan Forum Mahasiswa Islam FMIPA UNNES tahun 2022\r\n4. Ketua Departemen Pembinaan, Pengkaderan, dan Pengembangan Muslim Organization of Integrated Science tahun 2022\r\n5. Staff Departemen Kurikulum Unit Mentoring Agama Islam UNNES tahun 2022\r\n6. Staff Research and Science Departement Students Scientific Center 2022\r\nSaya aktif mengikuti berbagai kegiatan kemahasiswaan dan organisasi kampus selama belajar di UNNES. Melalui organisasi yang saya ikuti saya mendapatkan banyak ilmu, pengalaman, dan relasi baru. Saya dapat melatih kemampuan berbicara dan bersosialisasi dengan lingkungan. Saya memiliki banyak keterampilan, membentuk sikap disiplin, dan bertanggung jawab. Selain itu saya juga mempunyai pengalaman menjadi relawan di beberapa lembaga, yaitu:\r\n1. Volunteer Dompet Sejuta Harapan Klaten sebagai relawan muda fundrising\r\n2. Solo Peduli Klaten sebagai duta peduli Klaten\r\nHal ini saya lakukan agar saya dapat melatih kemampuan kepekaan terhadap lingkungan sekitar, mampu membantu bersama, menumbuhkan jiwa sosial yang tinggi, dan membangun mental tangguh. ',	1,	1655743236,	NULL,	0),
('SCHLR-TRKNN-82c115',	'USR-TRKNN-aee61',	'TERA Kennysrina Imany',	'2003-04-05',	'81333716669',	'Desa Tambibendo Kecamatan Mojo Kabupaten Kediri',	'Fisika/Pendidikan Fisika/Fakul',	'Universitas negeri Malang',	'3.74',	'1',	'Saya adalah mahasiswa Universitas negeri Malang dengan prodi Pendidikan Fisika,Saya masuk jurusan ini melalui jalur rapot (SNMPTN),kelas saya sekarang adalah Kelas  Bilingual dimana anggotanya bisa paham akan dua bahasa atau lebih. Selain mengikuti kelas,saya juga mengikuti organisasi yang disebut BDM (badan dakwah masjid) ,di organisasi tersebut banyak proker dan kepanitiaan yang dapat dilaksanakan. Jika ada waktu libur lumayan panjang skitar 3-4 hari saya akan pulang ke rumah. Saya punya adek,dia masih mau smp. ',	'Mimpiku adalah sebagai tenaga pendidik. Ya,mungkin orang akan memandang sebelah mata karena menjadi guru tidak se spesial itu bagi mereka. Tapi disini saya ingin menjadi guru atau tenaga pendidik agar ilmu saya bermanfaat ,apalagi jurusan saya yang tergolong sulit dan banyak siswa yang cenderung tidak menyukainya dan akhirnya menghindarinya. Tidak hanya ingin menjadi guru,guru atau tenaga pendidik yang hanya mengajar materi tapi juga mengajarkan arti hidup,mengapa kita haruslah belajar dan menuntut ilmu,intinya tidak hanya terfokus thd pelajaran tetapi juga memperbaiki budi pekerti.',	'Pengalaman organisasi saya yang pertama yaitu MEC,singakatan dari Masansa English Club. Dimana di organisasi ini belajar bahasa inggris dengan mendtaangkan tamu langsung dari luar negeri. Belajar bahasa inggris dengan cara menyenangkan,bermain,menghafal vocab dengan santai,dan di organisasi ini saya menjadi pengurus berupa sekertaris 1. Selain itu saya mengikuti organisasi SKI,sie keagamaan islam. Di organisasi ini lebih mempraktekkan bagaimana seharusnya kita sebagai umat islam,bersih2 masjid,dakwah lewat media elektronik,dan banyak proker lainnya. Dan yang baru2 ini kita mengikuti BDM,di organisasi ini seperti ski tapi versi di kuliah,banyak proker dan setiap minggunya selalu ada 2 jam untuk mentoring.',	1,	1654559281,	NULL,	0),
('SCHLR-TRNGG-24a706',	'USR-TRNGG-e14eb',	'Tiara Anggreani ',	'2004-09-19',	'81384389826',	'Perum Kota Serang Baru Blok D 32 No.11 RT.006 RW.016 Desa Sukaragam, Kec. Serang Baru, Kab.Bekasi',	'Sistem informasi',	'Universitas Bina Sarana Inform',	'0.00',	'0',	'Perkenalkan nama saya Tiara Anggreani, saya lahir di Wonogiri, 19 September 2004. Saya tinggal di Cikarang. Hobi saya menyanyi, saya suka ikut lomba menyanyi dan saya pernah mendapatkan juara 1 pada saat saya SMP. Saya sekolah di SMA dengan jurusan IPA dan saya sudah lulus tahun ini 2022.\r\n\r\nSaya anak pertama dari 3 bersaudara, kedua adik saya masih berusia belia. Sebagai anak tertua, saya tidak ingin membebani kedua orang tua saya. Saya ingin berkuliah karena ingin mengangkat derajat orang tua, supaya bisa mendapatkan kehidupan yang lebih baik, bisa menambah dan mengembangkan prestasi serta potensi diri, dan supaya bisa mempersiapkan diri dengan baik di dunia kerja.\r\n \r\nSejak awal masuk SMA saya sudah sangat berambisi agar saya bisa masuk kuliah negeri, dari kelas 10 sampai kelas 12 saya selalu masuk peringkat 10 besar. Karena saya selalu menjaga konsisten semangat belajar agar bisa masuk kuliah negeri. Akan tetapi takdir berkata lain, saya dinyatakan tidak lolos dalam seleksi masuk perguruan tinggi negeri.\r\n\r\nSaya ingin kuliah sambil kerja agar saya bisa mengurangi beban kuliah. Saya saat ini sudah mendaftar kuliah di Universitas Bina Sarana Informatika yang berada di Cikarang, saya mengambil jurusan Sistem Informasi dan kuliah akan di mulai pada bulan september 2022. Sambil menunggu masuk kuliah saya sempat bekerja sebagai kasir counter pulsa selama sebulan.\r\n\r\nAlasan saya memilih jurusan sistem informasi adalah karena saya merasa saat ini semua bidang memerlukan keahlian dalam bidang teknologi. Saya ingin menguasai keahlian dalam bidang teknologi untuk membuat suatu produk digital layaknya facebook, tiktok, youtube dll. Di jurusan ini saya bisa mempelajari dua bidang yakni Ilmu Komputer dan Manajemen. Kajian dalam ilmu Sistem Informasi juga menyesuaikan dengan perkembangan teknologi dan penggunaannya secara real oleh berbagai pihak membuat saya tertarik untuk memilih jurusan ini.',	'Mimpi terbesar saya adalah saya ingin menjadi pramugari ini adalah impian terbesar saya yang sudah saya impikan dari dulu. Saya juga ingin menjadi pengusaha sukses, saya ingin menjadi penyanyi, saya ingin memiliki kemampuan yang cakap di bidang teknologi, saya ingin membahagiakan orang tua, ingin mendapatkan beasiswa, dan ingin membeli suatu barang dengan uang sendiri.\r\n\r\nCara saya agar impian menjadi pramugari bisa terwujud adalah saya selalu belajar bahasa Inggris dengan memanfaatkan gadget, saya juga melatih diri saya untuk membuat french twist, serta saya rutin berolahraga supaya saya bisa mendapatkan berat badan yang ideal dengan tinggi badan saya 170cm. Kemudian, cara yang saya lakukan agar saya bisa menjadi pengusaha adalah saya mulai membuka online shop sejak pandemi, saya berjualan berbagai jenis masker karena saat pandemi keberadaan masker sangat di butuhkan oleh masyarakat. Lalu, cara saya supaya saya bisa menjadi penyanyi adalah saya memanfaatkan waktu luang saya dengan menyanyikan lagu-lagu kesukaan saya. Kemudian, cara saya supaya saya bisa mewujudkan impian saya yang lainnya adalah saya harus percaya diri, selalu berpikir positif, tidak malas, jangan mengeluh, semangat, pantang menyerah dan harus selalu berusaha menjadi yang terbaik.',	'Pengalaman organisasi saya di SMA adalah saya pernah menjadi panitia dalam event di sekolah, saya pernah menjadi seksi konsumsi, seksi keamanan, seksi peralatan dalam ekstrakurikuler yaitu ekstrakurikuler tahfiz dan seni vocal.',	1,	1654768273,	NULL,	0),
('SCHLR-TRPSP-c6b042',	'USR-TRPSP-13838',	'Tiara Puspa Dewi',	'2003-04-04',	'85755363151',	'Jl. Samanhudi 11, Kel. Bulusidokare, Kec. Sidoarjo, Kab. Sidoarjo, Jawa Timur',	'S1 Akuntansi',	'Universitas Negeri Surabaya',	'3.43',	'2',	'Saya adalah seorang mahasiswi jurusan akuntansi. Saya merupakan pribadi yang outgoing, percaya diri, dan berani. Berani untuk menyampaikan pendapat, untuk bertanya, dan mengambil resiko.',	'Mimpi terbesar saya adalah menjadi seorang wanita karir yang sukses dan independen, saya berharap beasiswa ini mampu membantu saya untuk mewujudkannya',	'Saat masa sekolah dulu saya mengikuti organisasi OSIS, dan lingkungan rumah, saya bergabung dengan organisasi Karang Taruna, dan semasa kuliah saat ini saya bergabung dengan Accounting Study Club dan juga mengikuti kepanitiaan mentoring . ',	1,	1653751902,	NULL,	0),
('SCHLR-TRSCH-d24b94',	'USR-TRSCH-cab5d',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654093483,	NULL,	0),
('SCHLR-TRWLN-a5bd2d',	'USR-TRWLN-baf9e',	'Tri Wulandari',	'2003-09-16',	'81358320266',	'Dusun Ngemplak\r\nDesa Munggugebang\r\nKec. Benjeng\r\nKab. Gresik',	'Fisika/Pendidikan Fisika/FMIPA',	'Universitas Negeri Surabaya',	'3.72',	'1',	'Nama saya Tri Wulandari. Saya adalah Mahasiswa Baru Tahun 2022 di Universitas Negeri Surabaya yang mengambil Prodi Pendidikan Fisika.\r\nSaya berpotensi di Bidang Sains, terutama di Bidang Fisika. Hal tersebut bisa dilihat ketika saya menjadi siswi MAN 2 Gresik, dimana kerap kali saya menjuarai Lomba Olimpiade. Beberapa diantaranya: Juara 1 Olimpiade Fisika oleh Universitas Syiah Kuala, Juara 1 Mathematic Education Competition oleh Universitas PGRI Kanjuruhan Malang, Juara 2 Olimpiade Keteknikan oleh ITERA, Juara 1 Olimpiade Sains oleh SMAIT Nurul Fikri Boarding School Bogor.\r\n\r\nTak hanya di bidang akademik, saya juga pernah berprestasi di bidang non-akademik. Pada November 2021, saya menjadi Juara Umum pada Lomba Teaching Bingo Challenge oleh STKIP Al-Hikmah Surabaya.\r\n\r\nSelain berprestasi, saya juga kerap aktif di organisasi sekolah seperti Fun English Club, agar bisa lebih komunikatif dan memperluas relasi dengan orang lain. Di Fun English Club, saya belajar Bahasa Inggris seperti Speaking dan Grammar. Bahkan setiap hari kamis, saya harus melakukan Oral Test. Terakhir, saat kelas 12 saya harus melakukan Examination. Puji syukur, saat Examination untuk kelulusan saya mendapatkan nilai A (Excellent).\r\n\r\nSelama 3 tahun di MAN 2 Gresik, selain berprestasi di Olimpiade dan aktif di organisasi sekolah saya juga mengikuti PRODISTIK. PRODISTIK adalah Program Pendidikan Terapan Bidang TIK yang bekerja sama dengan ITS. Di PRODISTIK, saya belajar mengoperasikan Microsoft Office dan karena saat penjurusan saya memilih jurusan desain grafis saya juga harus belajar software-software desain seperti CorelDRAW, Photoshop, dan Adobe Ilustrator.\r\n\r\nKegiatan di luar sekolah saya isi dengan mengikuti volunteer campign secara online agar saya selalu mendapatkan pengalaman baru dalam suatu aktivitas sosial. Tak hanya itu, sejak awal pandemi covid-19 saya juga kerap mengikuti webinar secara online. Bahkan untuk mengisi waktu senggang ketika kelas daring selesai, saya mengikuti kursus online Bahasa Inggris secara gratis.',	'Mimpi terbesar saya adalah menjadi seorang Dosen Pendidikan Fisika. Namun, untuk langkah awalnya saya berencana menjadi seorang Guru Fisika. Mengapa menjadi seorang pengajar (Dosen/Guru)? Karena saya ingin berkontribusi penuh dalam dunia pendidikan. Yang mana menurut saya dengan menjadi seorang pengajar adalah salah satu jalan yang bisa saya lakukan untuk ikut berkontribusi meningkatkan kualitas pendidikan di Indonesia.\r\n\r\nAda beberapa hal yang telah saya lakukan untuk mewujudkan impian menajdi seorang pengajar (Dosen/Guru):\r\n\r\nPertama, belajar dengan giat khususnya di mapel fisika yang nantinya akan saya jadikan pilihan pada saat kuliah. Dengan harapan agar nilai rapot saya selalu meningkat serta layak masuk kuota eligible SNMPTN sehingga saya bisa mengikuti dan juga lolos SNMPTN.\r\n\r\nKedua, mengikuti berbagai lomba baik di bidang akademik maupun non akademik. Jadi, pada awal kelas 10 saya sudah mulai mengikuti lomba speech di beberapa PTS terdekat. Hal tersebut saya lakukan guna mengasah kemampuan saya dalam public speaking. Selain itu, membuat saya menjadi pribadi yang percaya diri karena sudah terbiasa berbiacara di depan banyak orang.\r\nLalu, pada kelas 11 saya beralih mengikuti olimpiade fisika. Puji syukur, pada kelas 12 saya mulai menuai keberhasilan. Selama kelas 12 saya telah menjuarai olimpiade fisika sebanyak 5 kali di PTN maupun PTS di Indonesia. Dengan mengikuti lomba olimpiade, kemampuan saya dalam berpikir bisa terus meningkat dan membuat saya semakin giat belajar sebagai persiapan sebelum mengerjakan soal. Tentunya ilmu dan pengalaman yang saya miliki akan bertambah guna menjadi guru nanti.\r\nSelain itu, saya juga mengikuti lomba Teaching Bingo Challenge yang merupakan kompetisi belajar mengajar tingkat SMA/Sederajat. Dimana saya harus menjelaskan topik materi  sekolah menggunakan bahasa Inggris, presentasi ide kelas impian, presentasi ide ice breaking di kelas, bahkan saya harus mendongeng dan membuat alat peraga sederhana. Saya tertarik dengan lomba ini karena melatih kemampuan saya dalam mengajar di masa depan nanti setelah saya lulus kuliah.\r\n\r\nKetiga, aktif di organisasi sekolah. Sejak kelas 10 saya telah bergabung dalam FEC (Fun English Club) MAN 2 Gresik yang bekerja sama dengan Cambrige English Course Pare Kediri. Saya bergabung dalam FEC karena saya ingin meningkatkan kemampuan saya dalam berbahasa inggris. Dimana nantinya sebagai guru akan sangat berguna bagi saya dalam berinteraksi dalam lingkup sekolah bertaraf bilingual.',	'Saya memiliki pengalaman organisasi di Fun English Club.\r\nPada tahun 2019, Fun English Club mengadakan Mandagres English Competition. Saat itu saya ditujuk menjadi seksi dokumentasi yang bertugas mendokumentasikan momen perlombaan berlangsung hingga acara pengumuman lomba.\r\n\r\nSedangkan untuk volunteer, saya kerap mengikuti volunteer campaign secara online. Pada 8-9 Mei 2022, saya berpartisipasi dalam ECOFEST Volunteer Campign oleh UPN Jawa Timur. Selama 2 hari saya mengampanyekan tentang Bahaya dan Dampak Climate Change.',	1,	1654761238,	NULL,	0),
('SCHLR-TRZR-379e9e',	'USR-TRZR-6ae273',	'Tari Azari',	'2003-10-25',	'89636844255',	'Jln.jhoni Anwar no.9 ulak karang utara, kota Padang , sumatera barat',	'Sistem informasi',	'UPN VETERAN YOGYAKARTA',	'0.00',	'1',	'Saya adalah anak pertama dari 2 bersaudara,saya bertempat tinggal di kota Padang ,Sumatera Barat.Saya adalah mahasiswi semester 1 pada tahun ini,dikarenakan saya tamatan SMA pada tahun 2022 ini,saya lulus SNMPTN dan mendapatkan universitas di UPN veteran Yogyakarta.',	'Mimpi terbesar saya adalah saya ingin menjadi seorang programmer dan saya bisa membagi ilmu saya kepada orang lain serta bisa memberikan motivasi untuk diri saya dan orang  lain untuk berkembang serta berkreativitas.',	'Ya saya memiliki pengalaman organisasi di bidang sosial kemasyarakatan dan saya menjabat sebagai kepala departemen sosial kemasyarakatan selama 2 periode,dan saya pernah menjadi ini Adiwiyata di lingkungan semasa SMA saya.',	1,	1654567992,	NULL,	0),
('SCHLR-TSBTH-ee5c48',	'USR-TSBTH-159c2',	'Tsabitah El Ismah',	'2002-05-22',	'83812192570',	'Jl. Juanda, No. 72, Lingk. Wringin Anom, Jogosari, Pandaan',	'D4 TATA BOGA',	'UNIVERSITAS NEGERI SURABAYA',	'3.60',	'2',	'Saya adalah seorang mahasiswi semester 2, jurusan D4 Tata Boga di Universitas Negeri Surabaya. Saya memiliki minat dan bakat yang tinggi di bidang kuliner yang membuat saya ingin terus belajar dan berlatih dalam bidang ini untuk mendapatkan keahlian dan pengalaman yang mumpuni. Sebelum masuk kuliah tahun pertama, saya pernah membangun bisnis kuliner yang menjadi impian saya. Saya berhasil menjual produk makanan dengan menciptakan resep sendiri. Selama satu tahun perkuliahan saya tempuh, saya telah mempelajari banyak hal. Tak hanya belajar tentang kuliner, saya juga mendapat pengetahuan dan kesempatan dalam mengembangkan diri melalui kegiatan-kegiatan di lingkup kampus yang secara aktif saya ikuti. ',	'Mimpi terbesar saya adalah menjadi seorang chef dan membangun bisnis kuliner. Bisnis kuliner yang saya bangun harapannya dapat memberikan manfaat bagi orang-orang sekitar karena pendapatan yang saya miliki akan saya bagikan kepada anak yatim piatu dan kaum dhuafa serta mengadakan makan gratis setiap hari jumat bagi orang-orang yang membutuhkannya. Banyak sekali mimpi yang ingin saya wujudkan baik untuk diri sendiri, orang tua, keluarga maupun orang-orang diluar sana yang tidak saya kenali. Saya berharap bisa menjadi orang bermanfaat bagi orang lain. Tak pernah menyerah, terus belajar, mengembangkan diri menjadi lebih baik, berdoa dan berusaha menjadi bagian dari cara saya mewujudkan mimpi-mimpi saya. Melalui kegiatan yang saya lakukan harapannya dapat memberi saya motivasi, inspirasi, pengalaman dan pengetahuan baru yang dapat saya gunakan dan bagikan kepada orang lain. ',	'Saya pernah menjadi relawan di salah satu organisasi peduli kesehatan mental dengan aktivitas mempererat perhatian dunia kesehatan mental. Saya bersama anggota lain yang bergabung selalu ada kesempatan untuk berkomunikasi dan sharing antar sesama dengan saling menghormati dan mendukung. Saya dapat memberi inspirasi kepada banyak orang mengenai bagaimana indahnya sebuah perjuangan dalam menyembuhkan diri. Hambatan dan perjuangan dalam setiap masalah yang membawa kita berada di titik terendah dan berhasil melewatinya akan menjadi inspirasi untuk orang lain. Cerita-cerita yang di suarakan menjadi penyembuh dan kepercayaan bahwa setiap diri kita pasti mampu melewatinya dan melangkah kembali. ',	1,	1655725553,	NULL,	0),
('SCHLR-TSLZL-9cd467',	'USR-TSLZL-093d6',	'Atsila Zulfa Mahadewi',	'2002-03-12',	'81390152090',	'Wonolopo RT 1 RW 7, Kelurahan Wonolopo, Kecamatan Mijen, Kota Semarang',	'Prodi Perencanaan Wilayah Kota',	'Universitas Diponegoro',	'3.67',	'4',	'Nama saya Atsila Zulfa Mahadewi biasa dipanggil Atsila. Hobi saya adalah memasak dan menonton film. Saya adalah seorang mahasiswa S1 Perencanaan Wilayah dan Kota Universitas Diponegoro. Pendidikan yang sedang saya tempuh ini sudah berjalan selama 4 semester (2 tahun). Saya bercita-cita menjadi pengusaha sukses yang bergelut di bidang properti dan konstruksi. Kesibukan yang sedang saya jalani selain perkuliahan adalah organisasi di Himpunan Mahasiswa Teknik Planologi Undip 2022, membantu orang tua berjualan, hingga belajar hal baru mengenai dunia properti. Menjadi anak pertama perempuan dalam keluarga membuat saya terpacu untuk lebih tekun dan semangat dalam menempuh pendidikan guna mendukung meraih impian saya. Posisi saya tersebut menjadi motivasi untuk bekerja dan belajar lebih giat lagi. Dengan usia yang sudah menginjak kepala dua, membuat saya harus bergerak mandiri hingga berupaya bekerja hingga mencari beasiswa untuk membantu orang tua membiayai pendidikan yang sedang saya tempuh ini.',	'Mimpi terbesar saya adalah bisa menjadi pengusaha yang sukses. Pengusaha sukses yang saya impikan bergelut dalam dunia properti, kontraktor, maupun kuliner seperti cafetaria. Mimpi tersebut memang mimpi terbesar saya sejak saya berada di bangku SMP. Dimana pada saat itu saya berfikir bagaimana susahnya orang tua saya rela bekerja dan pernah berjualan es, parfum, jus, dan lain-lain yang halal demi memenuhi kebutuhkan pokok keluarga kami bahkan membiayai anaknya untuk bersekolah. Saya rasa untuk mewujudkan mimpi besar itu bisa dimulai dari mewujudkan impian-impian kecil lainnya. Salah satu impiannya tersebut yaitu bisa lulus kuliah masimal 4 tahun dan mendapat IPk akhir di atas 3.50. Tentu belajar memahami materi dan tugas yang diberikan dosen, serta mengaplikasikannya dengan praktikum langsung menjadi cara saya mewujudkan mimpi tersebut. Bahkan saya juga mengikuti organisasi Himpunan Mahasiswa Planologi Undip Tahun 2022 tepatnya di Bidang Ekonomi dan Bisnis sebagai wadah saya mengembangkan soft skill untuk modal dalam mewujudkan mimpi besar saya menjadi pengusaha sukses. Tidak cukup sampai disitu, saya juga berupaya terus mencari tau lebih dalam di dunia properti, berbagai mekanismenya hingga bisa ikut terjun langsung di dalamnya.\r\n',	'Saat ini saya sedang bergabung dalam organisasi Himpunan Mahasiwa Teknik Planologi (HMTP) Undip Tahun 2022. Organisasi ini merupakan wadah kegiatan pengembangan sumber daya mahasiswa melalui kegiatan aktif, kreatif, dan inovatif. Saya bergabung dalam salah satu bidang di dalamnya yaitu Bidang Ekobis (Ekonomi dan Bisnis) sebagai Sekretaris Bidang. Bidang ini juga pernah saya geluti di tahun sebelumnya, namun sebagai Staff Muda. Di dalam bidang ini saya banyak belajar bagaimana memiliki dan mengembangkan jiwa kewirausahaan serta tips and trick berjualan hingga mengelola keuangan di dalam bisnis walaupun kecil. Selain itu, saya juga aktif mengikuti berbagai kepanitiaan yang diselenggarakan oleh HMTP dari tahun 2021-2022. Saya juga pernah mengikuti organisasi Palang Merah Remaja (PMR) semasa SMA sebagai Wakil Ekstern dan pengalaman menjadi Ketua Panitia Lomba PMR se-Jawa Tengah yang diselenggarakan oleh organisasi saya tersebut. Bahkan melalui organisasi tersebut pernah menyelenggarakan donor darah di SMAN 3 Semarang yang bekerja sama dengan PMI Kota Semarang.',	1,	1655623594,	NULL,	0),
('SCHLR-TSLZL-e73ff8',	'USR-TSLZL-093d6',	'Atsila Zulfa Mahadewi',	'2002-03-12',	'81390152090',	'Wonolopo RT 1 RW 7, Kelurahan Wonolopo, Kecamatan Mijen, Kota Semarang',	'Prodi Perencanaan Wilayah Kota',	'Universitas Diponegoro',	'3.67',	'4',	'Nama saya Atsila Zulfa Mahadewi biasa dipanggil Atsila. Hobi saya adalah memasak dan menonton film. Saya adalah seorang mahasiswa S1 Perencanaan Wilayah dan Kota Universitas Diponegoro. Pendidikan yang sedang saya tempuh ini sudah berjalan selama 4 semester (2 tahun). Saya bercita-cita menjadi pengusaha sukses yang bergelut di bidang properti dan konstruksi. Kesibukan yang sedang saya jalani selain perkuliahan adalah organisasi di Himpunan Mahasiswa Teknik Planologi Undip 2022, membantu orang tua berjualan, hingga belajar hal baru mengenai dunia properti. Menjadi anak pertama perempuan dalam keluarga membuat saya terpacu untuk lebih tekun dan semangat dalam menempuh pendidikan guna mendukung meraih impian saya. Posisi saya tersebut menjadi motivasi untuk bekerja dan belajar lebih giat lagi. Dengan usia yang sudah menginjak kepala dua, membuat saya harus bergerak mandiri hingga berupaya bekerja hingga mencari beasiswa untuk membantu orang tua membiayai pendidikan yang sedang saya tempuh ini.',	'Mimpi terbesar saya adalah bisa menjadi pengusaha yang sukses. Pengusaha sukses yang saya impikan bergelut dalam dunia properti, kontraktor, maupun kuliner seperti cafetaria. Mimpi tersebut memang mimpi terbesar saya sejak saya berada di bangku SMP. Dimana pada saat itu saya berfikir bagaimana susahnya orang tua saya rela bekerja dan pernah berjualan es, parfum, jus, dan lain-lain yang halal demi memenuhi kebutuhkan pokok keluarga kami bahkan membiayai anaknya untuk bersekolah. Saya rasa untuk mewujudkan mimpi besar itu bisa dimulai dari mewujudkan impian-impian kecil lainnya. Salah satu impiannya tersebut yaitu bisa lulus kuliah masimal 4 tahun dan mendapat IPk akhir di atas 3.50. Tentu belajar memahami materi dan tugas yang diberikan dosen, serta mengaplikasikannya dengan praktikum langsung menjadi cara saya mewujudkan mimpi tersebut. Bahkan saya juga mengikuti organisasi Himpunan Mahasiswa Planologi Undip Tahun 2022 tepatnya di Bidang Ekonomi dan Bisnis sebagai wadah saya mengembangkan soft skill untuk modal dalam mewujudkan mimpi besar saya menjadi pengusaha sukses. Tidak cukup sampai disitu, saya juga berupaya terus mencari tau lebih dalam di dunia properti, berbagai mekanismenya hingga bisa ikut terjun langsung di dalamnya.',	'Saat ini saya sedang bergabung dalam organisasi Himpunan Mahasiwa Teknik Planologi (HMTP) Undip Tahun 2022. Organisasi ini merupakan wadah kegiatan pengembangan sumber daya mahasiswa melalui kegiatan aktif, kreatif, dan inovatif. Saya bergabung dalam salah satu bidang di dalamnya yaitu Bidang Ekobis (Ekonomi dan Bisnis) sebagai Sekretaris Bidang. Bidang ini juga pernah saya geluti di tahun sebelumnya, namun sebagai Staff Muda. Di dalam bidang ini saya banyak belajar bagaimana memiliki dan mengembangkan jiwa kewirausahaan serta tips and trick berjualan hingga mengelola keuangan di dalam bisnis walaupun kecil. Selain itu, saya juga aktif mengikuti berbagai kepanitiaan yang diselenggarakan oleh HMTP dari tahun 2021-2022. Saya juga pernah mengikuti organisasi Palang Merah Remaja (PMR) semasa SMA sebagai Wakil Ekstern dan pengalaman menjadi Ketua Panitia Lomba PMR se-Jawa Tengah yang diselenggarakan oleh organisasi saya tersebut. Bahkan melalui organisasi tersebut pernah menyelenggarakan donor darah di SMAN 3 Semarang yang bekerja sama dengan PMI Kota Semarang.',	1,	1655623339,	NULL,	0),
('SCHLR-VBRNH-1dfcb1',	'USR-VBRNH-ce52e',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654248648,	NULL,	0),
('SCHLR-VCKDN-098673',	'USR-VCKDN-96d5b',	'Vicko Danendra Setyo Yuwono',	'2002-09-29',	'88225276819',	'Cinderejolor Rt04 Rw05, Gilingan, Banjarsari, Surakarta',	'Informatika',	'Universitas Sebelas Maret',	'3.75',	'4',	'Nama saya Vicko Danendra Setyo Yuwono. Saya mahasiswa UNS jurusan Informatika semester 4. Saya merupakan orang yang senang belajar dan mencoba hal-hal yang baru, mudah bekerja sama, dan akan berusaha semaksimal mungkin dalam menyelesaikan semua yang sudah saya mulai.',	'Mimpi terbesar saya tentu yang pertama adalah membahagiakan orang tua. Untuk mewujudkan hal tersebut, saya akan berusaha semaksimal mungkin dalam hal belajar, mencari pengalaman positif, dan terus berusaha supaya dapat berguna bagi orang lain. \r\nMimpi kedua saya adalah menjadi seseorang yang sukses dalam kehidupan dunia dan akhirat. Di kehidupan dunia, saya akan terus berusaha untuk mengembangkan skill supaya dapat mencapai kesuksesan. Dengan dibarengi usaha yang maksimal tentu tidak lupa dengan beribadah dan berdoa kepada tuhan supaya dimudahkan jalannya.',	'Selama kuliah, saya pernah ikut organisasi Himpunan Mahasiswa Informatika dan berada pada divisi teknologi, yang mengurus segala hal yang berhubungan dengan teknologi. Selama di himpunan tersebut, saya mendapatkan berbagai pengalaman karena mengerjakan berbagai proker, seperti contohnya menjadi pemateri dalam suatu klub yang membahas tentang UI/UX, dan menjadi panitia dalam berbagai proker. Di berbagai proker tersebut, saya berada dalam divisi teknologi yang mengurus tentang website, membuat soal competitive programming, serta hal yang lainnya.',	1,	1653581119,	NULL,	0),
('SCHLR-VLLRT-6f0e44',	'USR-VLLRT-172ce',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655742160,	NULL,	0),
('SCHLR-VLTLD-2e2737',	'USR-VLTLD-b8d03',	'Voleta Alda Lathifah ',	'2003-05-28',	'81358052131',	'Jl. PB Sudirman No 78 Patrang Jember',	'Fisika FMIPA',	'Universitas Brawijaya',	'0.00',	'1',	'Saya Voleta Alda yang bertempat tinggal di Kota Jember. Keluarga besar berada di Yogyakarta, tetapi saya dengan orang tua tinggal di Jember untuk pekerjaan. Kedua Orang tua saya sama-sama wiraswasta yaitu tentor di salah satu bimbingan belajar. Saya memiliki saudara kandung laki-laki (kakak) yang tengah menempuh pendidikannya di Universitas Jember jurusan Pendidikan Matematika. Kakak saya salah satu penerima KIP kuliah. Saya baru saja lulus di bulan Juni ini dari SMAN 1 Jember. Saya juga sudah diterima di Universitas Brawijaya Prodi Fisika dengan jalur SNMPTN. Kini kegiatan yang sedang saya lakukan adalah persiapan masuk kuliah dan apply berbagai beasiswa.',	'Mimpi terbesar saya adalah membangun bidang kesehatan Indonesia lebih baik. Sektor kesehatan menjadi pilar utama bagi kehidupan bernegara. Kesejahteraan rakyatnya berdasarkan fasilitas kesehatannya. Namun fasilitas kesehatan kini tidak merata dan tak jarang ke luar negeri untuk pengobatan dengan alasan alat lebih canggih/ dapat dipercaya. Hal seperti itu dapat dilakukan untuk kalangan atas. Sedangkan 40% dari 269 juta warga negara Indonesia hidup dengan pendapatan dibawah rata-rata. Mereka tidak mampu berobat hingga luar negeri. Oleh karena itu, saya ingin membuat alat-alat kesehatan yang dibutuhkan melalui ilmu terapan fisika. Denan alat-alat ini dapat membantu meningkatkan kualitas fasilitas kesehatan di Indonesia. ',	'Saya memiliki pengalaman organisasi saat SMP dan SMA. Saat SMP saya sebagai Sekretaris Umum OSIS dan Humas di PMR. Saat di PMR saya pernah sosialisasi mengenai NAPZA di kam[ung-kampung sekitar. Lalu untuk SMA ini saya menjabat sebagai Sekretaris di Organisasi Pecinta Al-Quran SMAN 1 Jember. Diluar lingkungan sekolah saya juga mengikuti Organisasi / Relawan yaitu YALIDI CARE. YALIDI CARE ini relawan dengan berbagai profesi, umur yang sigap membantu apa saja. Contohnya banjir di Jember, kami turun tangan untuk pembersihan rumah serta dapur bersih. Setiap bulan juga dilakukan sisir sungai dan pantai untuk membersihkan dari sampah-sampah. Sala satu kegiatan besar lainnya yaitu relawan di Semeru untuk penyaluran dana bantuan dan dapur darurat.',	1,	1653669068,	NULL,	0),
('SCHLR-VLYNG-ed8ef8',	'USR-VLYNG-986f5',	'EVELYN GABRIELLA SULIANTORO',	'2004-06-02',	'8987279093',	'Jl. KH. Ahmad Dahlan No.11, Yogyakarta',	'Teknologi Pangan',	'Universitas Gadjah Mada',	'0.00',	'0',	'Nama saya Evelyn Gabriella Suliantoro, orang-orang biasa memanggil saya Evelyn. Arti nama saya adalah terang, maka dari itu saya ingin benar-benar menghidupi nama saya dengan menjadi terang yang berdampak bagi dunia. Sejujurnya, saya adalah seorang lulusan SMA Negeri 1 Yogyakarta yang masih belum resmi menjadi mahasiswa walaupun sudah diterima UGM melalui jalur SNMPTN. Namun, saya percaya bahwa kesempatan pendidikan selalu terbuka bagi setiap orang yang berusaha tanpa terkecuali. Dalam rentang waktu ini, saya tidak mendefinisikan diri saya sebagai pengangguran walaupun terlihat demikian. Saya tetap menekuni hobi saya dalam bermusik dengan aktif melayani di gereja. Selain itu, hobi saya yang lain adalah membaca dan menulis. Sejauh ini, saya sudah mempunyai 5 buku antologi yang ditulis bersama teman-teman komunitas kepenulisan. Dalam komunitas yang lebih kecil yakni keluarga, saya tidak melupakan peran saya sebagai seorang anak pertama. Sebagai kakak, saya memiliki tanggung jawab membantu adik saya dalam ASPD SMP yang bagi sebagian temannya menjadi persoalan serius. Tentu saja hal ini juga persoalan serius untuk saya dan adik saya, berhubung jarak kami menempuh pendidikan adalah 3 tahun. Ketika dia membayar SMA, saya harus membayar UKT kuliah. Oleh karena itu, tanpa mengurangi rasa hormat, saya mencoba kesempatan ini dengan harapan dapat mengurangi beban perekonomian keluarga saya yang baru pulih dari pandemi.',	'Mimpi terbesar saya adalah membuat keluarga saya bangga dan membantu orang-orang di luar sana sehingga setidaknya mereka bisa makan dengan layak tanpa harus merasakan kelaparan. Saya bersyukur dapat tumbuh di lingkungan yang mencukupi kebutuhan pangan saya sehingga saya tak pernah mengalami masalah kurang gizi. Akan tetapi, saya mengerti bahwa tak semua orang dapat merasakan hal serupa. Saya ingin membuka usaha di bidang makanan dengan nama mama saya. Alasannya adalah beliau sangat menyukai bidang makanan dan dianugerahi bakat memasak. Sayangnya, bakat memasak itu hanya terbentur untuk kepentingan rumah dan usaha kecil-kecilan dengan sistem PO karena tidak memiliki cukup biaya.  Saya berencana, nantinya penghasilan melalui usaha ini akan saya sisihkan sebagai donasi untuk mereka yang kurang mampu agar tidak merasakan kelaparan. Saya tahu tidak dapat membantu satu dunia untuk pulih dari bencana kelaparan. Namun, bila saya dapat membantu setidaknya 1 orang supaya dapat makan dengan layak, kenapa tidak?',	'Saya pernah tergabung dalam komunitas kepenulisan online. Di sana, saya aktif mengikuti kelas kepenulisan dan membantu pemula dalam berkarya. Selain itu, saya juga mencoba pengalaman sebagai peminang naskah di sebuah penerbit indie dan semi mayor sebagai penghasilan tambahan. Di sekolah, saya tergabung dalam komunitas musik yaitu orkestra dengan saya sebagai sekretaris. Selain itu, saya juga tergabung dalam komunitas literasi dan sastra yang menyelenggarakan event eksternal bagi siswa SMP-SMA se-Yogyakarta.',	1,	1654167527,	NULL,	0),
('SCHLR-VNNNN-a94fff',	'USR-VNNNN-d5379',	'Vannia Annica Silitonga',	'2004-12-03',	'85265297469',	'Jln. Gunung Martimbang 2,Lalang, Rambutan, Tebing Tinggi, Sumut',	'11 MIPA',	'SMAN 1 TEBING TINGGI',	'9.14',	'2',	'Nama saya Vannia Annica Silitonga, dan saat ini saya bersekolah di SMAN 1 TEBING TINGGI. Saya senang belajar di sana, terutama karena saya bisa mengambil kelas MIPA. Juga, saya menghabiskan banyak waktu di luar studi saya mengikuti perlombaan olimpiade. Saat saya tidak membaca atau mendengarkan musik. Saya suka menghabiskan waktu dengan mengikuti bimbingan belajar dan ekstrakurikuler disekolah.',	'Apa mimpi terbesar yang ingin aku wujudkan? Sudah tentu banyak sekali. Dan saya berharap ini bisa terwujud seiring berjalannya waktu dan jika saya di beri umur panjang serta sehat.\r\n\r\n1.keluarga saya bisa hidup berkecukupan serta di berikan kesehatan dan juga umur panjang\r\n\r\n2.Ingin membuat keluarga saya bangga dengan saya lolos di cita-cita saya sebagai dokter\r\n\r\n3.Membuatkan rumah serta usaha kecil kecilan untuk orang tua saya\r\n\r\nCara saya mewujudkannya yaitu :\r\n1. Berdoa kepada Tuhan agar diberi jalan dan petunjuk agar saya bisa menggapai itu semua\r\n\r\n2. Bekerja dan belajar dengan giat, agar bisa menjadi kebanggaan bagi orang tua',	'Tidak ada',	1,	1653540566,	NULL,	0),
('SCHLR-VNNYP-236aa0',	'USR-VNNYP-fb0b4',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655708403,	NULL,	0),
('SCHLR-VNRSY-a03223',	'USR-VNRSY-b4325',	'Vania Rei Syifa',	'2001-10-04',	'82383007900',	'Dusun Sungai Sariak Utara Jorong Sungai Sariak, Kanagarian Koto Tinggi, Kecamatan Baso, Kabupaten Agam, Provinsi Sumatera Barat',	'Ilmu Komunikasi / Ilmu Sosial ',	'Universitas Andalas',	'3.75',	'4',	'Perkenalkan saya Vania Rei Syifa dari jurusan Ilmu Komunikasi Universitas Andalas. Pada bulan Mei 2021 lalu, saya dipercaya oleh jurusan saya untuk mengikuti seleksi Pemilihan Mahasiswa Berprestasi Tingkat Fakultas Ilmu Sosial dan Politik Universitas Andalas. Saya diberikan beberapa proyek untuk membuat ide kreatif dan poster yang berhubungan dengan Sustainable Development Goals. Saya mengambil tema mengenai ide permasalahan sekolah offline selama pandemi. Langkah yang saya lakukan yaitu saya melakukan riset mendalam bersama dengan dosen mengenai ide tersebut serta mengaitkan dengan pola komunikasi. Diharapkan dengan dilakukannya penelitian ini, saya bisa berkonstribusi di bisnis komunikasi dengan meluncurkan yayasan pengembangan skill berbicara di depan umum dan menulis kreatif mahasiswa. Selain , saya juga berlatih cara mempresentasikan serta menyajikan ide ilmiah di depan para juri. Langkah lain yang juga saya lakukan yaitu menambah pengalaman di berbagai perlombaan di bidang komunikasi, narasumber webinar tentang beasiswa sarjana, dan juga mencoba mendaftar beasiswa pendidikan maupun pelatihan. Walaupun, saya berada pada peringkat tujuh dari delapan peserta, namun saya sangat bangga mengikuti seluruh tahapan ini serta berusaha kembali mencoba untuk seleksi di tahun yang akan datang. Untuk seleksi yang akan datang, saya perlu meningkatkan kemampuan presentasi dalam bahasa Inggris dengan cara rutin berlatih melalui platform digital YouTube.  Selain itu untuk bidang non akademik, saya juga aktif dalam mengikuti berbagai progam beasiswa tingkat nasional seperti beasiswa untuk biaya kuliah KIPK ( Kartu Indonesia Pintar Kuliah ) dan beberapa beasiswa pelatihan online. Awalnya, saya kesulitan dalam mengikuti tahapan administrasi dan wawancara. Bahkan, diantara beasiswa tersebut saya mengalami kegagalan dan ditolak. Pada saat itu, saya pun mulai mengatur strategi dengan melakukan review Curriculum Vitae, Motivation Letter, serta wawancara bersama dengan para penerima beasiswa yang banyak saya temui melalui relasi pertemanan selama perkuliahan. Selain itu, saya juga mencoba banyak beasiswa untuk memperbesar peluang untuk lolos kurang lebih terdapat ratusan beasiswa yang telah saya coba daftarkan. Hasil peroleh yaitu saya berhasil meraih kurang lebih 31 jenis beasiswa tingkat nasional. Semua keberhasilan tersebut, merupakan konstribusi dari Tuhan, rekan para penerima beasiswa, serta kegigihan saya untuk mendapatkan beasiswa.',	'Mimpi terbesar saya yaitu antara lain :\r\n        1. Menjadi mahasiswa berprestasi yang memiliki prestasi baik dalam kampus maupun luar kampus.\r\n        2. Lulus dengan predikat cumlaude di Universitas Andalas.\r\n        3. Lulus Beasiswa S2 ke luar negeri yaitu Beasiswa LPDP,Chevening,Erasmus,dan lain-lain.\r\n        4. Melanjutkan pendidikan master (S2) pada Progam Studi Media and Communication di London School of Economics,UK.\r\n        5. Cita-cita saya ke depannya ingin menjadi pengusaha muda yang sukses,penulis,diplomat,dan peneliti yang sukses.\r\n        6. Menghajikan dan mengumrahkan orang tua ke tanah suci Mekah.\r\n        7. Mengelilingi ke berbagai belahan dunia bersama keluarga besar.\r\n\r\nBagaimana cara saya untuk mewujudkannya yaitu antara lain :\r\n        1. Aktif dalam belajar di kampus serta juga aktif berorganisasi\r\n        2. Berusaha meningkatkan nilai IPK agar semakin naik per semester\r\n        3. Memersiapkan segala dokumen beasiswa dengan baik dan lengkap,serta berusaha memeroleh nilai TOEFL/IELTS sebaik mungkin\r\n        4. Memperbanyak kegiatan yang bersifat kerelawanan dan kegiatan yang menunjang agar semakin terasahnya skill leadership/kepempimpinan.\r\n        5. Rajin dan pantang menyerah untuk menggapai mimpì\r\n        6. Memersiapkan investasi di masa depan dengan çara sering menabung dan berwirausaha di usia dini\r\n        7. Man Jadda Wa Jada yang artinya Siapa yang bersungguh-sungguh, maka dialah yang akan mendapat.',	'Saya memiliki pengalaman organisasi atau relawan yaitu antara lain : \r\nSaat ini saya merupakan salah satu anggota dari Unit Kegiatan Mahasiswa ( UKM ) yaitu FKI Rabbani Universitas Andalas dengan bidang magang Entrepreneur pada tahun 2020.Lalu,saya juga diamanahkan sebagai anggota FKI Rabbani Universitas Andalas Bidang Public Relations Tahun 2021 serta saya juga aktif dalam kegiatan di luar kampus seperti Anggota Volunteer Scholars for Sumatera Batch 3.0 Bidang Empowerment and Development Tahun 2021.Alhamdulillah saya juga pernah ditunjuk sebagai salah satu Mentor dalam Aksi Sahabat Desa oleh Indonesia Millenial Connect Tahun 2020 dan juga Promotor Influencer Desa Indonesia Tahun 2021.',	1,	1653312232,	NULL,	0),
('SCHLR-VTRHM-2bc8c6',	'USR-VTRHM-f7192',	'Vita Rahmada',	'2004-06-29',	'85231224288',	'Dsn. Plosokendal RT 04/RW 07 Ds. Plosogeneng,\r\nJombang, Jawa Timur',	'Teknik Informatika',	'Universitas Negeri Surabaya',	'3.76',	'4',	'Saya orangnya suka mencoba banyak hal baru. Bagi saya mempelajari hal baru itu sangat seru, karena bisa menambah wawasan dan bertemu orang baru. \r\nSaya orangnya juga terjadwal, saya selalu mencatat apa yang harus dilakukan besok, karena sebenarnya saya sendiri orangnya pelupa.',	'Punya hidup yang sejahtera dan tentunya bahagia. \r\nSaya memulainya dengan mencoba banyak hal. Saya mengikuti seminar, volunteer, organisasi, melakukan kerja untuk mengembangkan skill agar bisa masuk di perusahaan yang saya inginkan. ',	'Iya punya. Untuk organisasi, saya ikut organisasi FORMUSA (Forum Muslim UNESA). Di formusa saya berada di divisi humas. Kegiatan di formusa sendiri sangat beragam. \r\n\r\nUntuk relawan, saat ini saya mengikuti volunteer SAN (Senyum Anak Nusantara). SAN ini di lakukan secara offline, di daerah saya, yaitu Jombang. SAN tahun ini baru sukses melaksanakan 1 acara, yaitu seribu senyum nusantara (SSN), kegiatan ini dilaksanakan di panti asuhan, kita memberikan edukasi, bermain bersama, dan berbagi hadiah. Untuk acara-acara selanjutnya sudah terjadwal. Acara yang paling dekat di jadwalnya berikutnya ada jumat berkah dan sekolah nusantara. Untuk jumat berkah, kita berbagi hasil donasi-donasi kepada yang membutuhkan. Sedangkan untuk sekolah nusantara, kita mengajar di sekolah.',	1,	1655613400,	NULL,	0),
('SCHLR-WDNSY-8e4fde',	'USR-WDNSY-b1774',	'WAODE NASYRAH RAFIQA',	'2003-04-04',	'82328422941',	'Komplek perumahan lepo-lepo mas Kota kendari',	'KIMIA',	'UNIVERSITAS HALU OLEO',	'3.78',	'4',	'saya merupakan anak bungsu dari tiga bersaudara. saya lahir di keluarga yang sederhana. ayah saya seorang guru SD dan ibu saya seorang pegawai kelurahan. Lahir di keluarga yang sederhana membuat saya terlatih untuk menjadi pribadi yang sederhana. Namun dibalik kesederhanaan itu, saya memiliki pemikiran yang kritis dan inovatif. Saya selalu tepat waktu dalam berbagai hal karena menurut saya tindakan tidak tepat waktu adalah langkah awal untuk menjauhkan seseorang dari kesuksesannya. Saya giat dalam menuntut ilmu dan suka mempelajari hal baru. Saya  suka berbicara bahasa inggris dan jika dirumah saya suka berbicara menggunakan bahasa daerah tanah kelahiran saya. ',	'Mimpi terbesar saya adalah menjadi Seorang Menteri Riset Teknologi dan Pendidikan Tinggi. Untuk mewujudkan itu tentunya saya belajar dengan giat dan menekuni passion saya. Selain itu untuk menjadi seorang menteri saya harus memiliki jiwa kepemimpinan. Oleh karena itu saya membiasakan diri untuk menjadi seorang pemimpin dengan memulai untuk memimpin diri sendiri. Saya juga selalu mensyukuri setiap proses yang saya dapatkan dan selalu menjadikan hal baru sebagai pelajaran agar saya dapat imrove diri setiap harinya. Untuk menyempurnakan itu semua saya harus bertawakal kepada Allah SWT.',	'Sejak SD saya sudah mengikuti organisasi pramuka. Organisasi ini menjadikan saya memiliki banyak relasi dari sekolah-sekolah lain. Saat SMP saya mengikuti Jambore Nasional 10 di Cibubur Jakarta mewakili Provinsi Sulawesi Tenggara. Saat SMA saya mewakili Kabupaten Muna di perkemahan Wirakarya Sulawesi tenggara. Saya juga pernah menjadi Duta Pariwisata Kabupaten Muna 2019. Dalam organisasi intra sekolah saya pernah menjadi ketua OSIS SMPN 2 NAPABALANO tahun 2017 dan Ketua MPK SMAN 1 Napabalano pada tahun 2019. Saat ini saya tergabung dalam organisasi Himpunan Mahasiswa Jurusan Kimia Fakultas MIPA UHO 2022.',	1,	1655273161,	NULL,	0),
('SCHLR-WDYNK-d18d6e',	'USR-WDYNK-c90b0',	'Widya Enik Rahayu',	'2002-12-18',	'85706042343',	'Jl. Haji Dahlan, Rejosari, Darungan, Pare, Kediri, Jawa Timur',	'Akuntansi',	'Universitas Negeri Malang',	'3.22',	'2',	'Saya Widya Enik Rahayu, mahasiswa akuntansi dari Universitas Negeri Malang. Saya mengetahui bahwa setiap orang memiliki kemampuan yang berbeda-beda dan saya juga menyadari bahwa banyak hal yang belum bisa saya kuasai. Namun, saya selalu berusaha untuk mengembangkan kemampuan saya semaksimal mungkin dan tidak mudah menyerah. Saya juga antusias dalam kegiatan-kegiatan sosial dan pelestarian alam. Saya juga senang jika bisa membagikan ilmu yang saya miliki.',	'Sesuai dengan jurusan yang saya ambil, saya ingin menjadi seorang akuntan yang profesional. Selain itu, saya juga ingin menjadi seorang pengusaha salah satunya di bidang kuliner dan saat ini saya sedang mencoba membuat produk-produk yang inovatif dan dapat diterima oleh berbagai kalangan.',	'Ya, saya pernah mengikuti kegiatan penggalangan dana untuk korban bencana alam. Selain itu, saya juga aktif dalam berorganisasi. Beberapa hari terakhir ini, saya juga baru menyelesaikan proker organisasi dimana saya melakukan kegiatan mengajar di sekolah dasar yang kualitas pendidikannya masih kurang jika dibandingkan dengan sekolah dasar di Kabupaten.',	1,	1655715490,	NULL,	0),
('SCHLR-WHYNS-a70911',	'USR-WHYNS-6a801',	'WAHYUNI SAPITRI',	'2000-05-30',	'82223335474',	'Jambi',	'Ilmu hukum',	'Universitas sriwijaya',	'3.88',	'4',	'Sebelumnya terimakasih atas kesempatanya kenalin saya wahyuni sapitri mahasiswi ilmu hukum universitas sriwijaya dimana saya sehari-hari selain sibuk kuliah saya juga ikut organisasi dan dapat amanah jadi salah satu ketua cabang bagian pelopor pendidikan selain itu saya juga bekerja di bagian pengarsipan guna untuk mengurangi beban orang tua saya untuk jajan sehari-hari saya dan saya punya mimpi semoga apa yang saya dapatkan dan usahakan saat ini kenak bakal jadi hal yang bermanfaat baik bagi saya dan khalayak dan saya tipikal wanita yang berprinsip pantang menyerah sebelum berhasil yang jelas di landasi atas usaha dan doa agar di setiap langkahku selalu ada keberkahan',	'Mimpi terbesar saya adalah ingin menjadi seorang pejabat atau public pigur bidang politik agar saat saya duduk di kursi jabatan saya dapat merusak semua kebijakan yang tidak sesuai dan saya merevisi dengan kebijakan yang sangat bermanfaat bagi khalayak, dari rakyat oleh rakyat dan untuk rakyat cara saya untuk mewujudkannya yang jelas saat ini saya fokus mengejar s1 saya dulu setelah itu saya masuk partai politik kemudian membuat program kerja yang langsung berbaur pada rakyat agar rakyat dapat mengenal saya dan ketika sudah mantap saya mengajukan diri menjadi kandidat',	'Iyap, allhamdulilah untuk hal ini saya banyak memiliki pengalaman organisasi salah satunya yaitu gerakan peduli kabupaten dimana di gerakan ini saya ikut serta menjadi pelopor pengerak penyanbunh aspirasi rakyat ke pejabat daerah mengenai jalan yang rusak selain itu di bidang pengabdian saya anggota PMI ranting kecamatan saya saat itu berkontribusi di bagian penyuluhan kesehatan saat kovid dan saya juga menjadi sekretaris umum forum di bkkbn',	1,	1653561873,	NULL,	0),
('SCHLR-WJYNT-878621',	'USR-WJYNT-d8896',	'Wijayanti Rachma',	'2003-04-01',	'85777647306',	'Kp. Pasir Gombong RT 004 RW 006 Gang ungu No.132 Kec. Cikarang Utara Kab. Bekasi Jawa Barat',	'Ilmu Hukum',	'Universitas Singaperbangsa Kar',	'3.86',	'2',	'Saya saat ini berkuliah di Universitas Singaperbangsa Karawang saya adalah orang yang mudah bergaul dan bekerjasama, hal ini sangat sinkron dengan kemampuan komunikatif yang saya miliki, Mempelajari hal baru menjadi acuan saya untuk terus mengembangkan potensi diri. Selain aktif dalam kegiatan non akademik seperti seni dan olahraga, saya juga memiliki beberapa prestasi akademik yang hinga sekarang saya jadikan sebagai motivasi. saya dikenal sebagai probadi yang ceria. saya senang ketika orang disekitar saya tertawa saat sedang bersama saya, saya sangat suka bertemu dengan orang baru. Dengan latar belakang keluarga broken home tidak saya jadikan sebagai suatu kekurangan, tetapi saya jadikan sebagai kelebihan yang tidak semua orang dapat memilikinya. ',	'Mimpi terbesar saya adalah menjadi orang yang sukses dan berguna bagi agama, nusa, dan bangsa. Dewasa nanti, saya ingin menjadi Jaksa yang adil dan bertanggung jawab terhadap perkerjaan saya. saua ingin menjadi orang yang berguna bagi orang lain. Cara saya mewujudkan hal ini adalah belajar dengan sungguh-sungguh dan tidak takut untuk mencoba hal baru yang menantang. Melalui beasiswa ini, saya yakin akan memeberikan pengaruh yang sangant besar dalam karir saya kedepan.',	'Saat ini dikampus saya tergabung dalam forum karya dan seni mahasiswa fakultas hukum universitas singaperbangsa karawang, organisasi ini saya jdikan sebagai wadah untuk menyalurkan hobi dan meningkatkan kemampuan diri. Sebagai anak dari seorang ayah yang merupakan pemimpin Lembaga swadaya masyarakat yang bergerak dalam lingkup lingkungan hidup, saya sering ikut dalam berbagai kegiatan mulai dari penanaman pohon mangrove, menjadi relawan pada saat bencana alam. Berpartisipasi dalam kegiatan ini merupakan hal yang sangat berkesan bagi saya, meLalui kegiatan ini saya banyak bertemu dengan orang baru dengan latar belakang yang berbeda dan disetiap cerita hidup mereka memberikan banyak insiprasi bagi saya.',	1,	1655129013,	NULL,	0),
