('SCHLR-WJYNT-fecf7b',	'USR-WJYNT-d8896',	'Wijayanti Rachma',	'2003-01-04',	'85777647306',	'Kp. Pasir Gombong RT 004 RW 006 Gang ungu No.132 Kec. Cikarang Utara Kab. Bekasi Jawa Barat',	'Ilmu Hukum',	'Universitas Singaperbangsa Kar',	'3.86',	'2',	'Saya saat ini berkuliah di Universitas Singaperbangsa Karawang saya adalah orang yang mudah bergaul dan bekerjasama, hal ini sangat sinkron dengan kemampuan komunikatif yang saya miliki, Mempelajari hal baru menjadi acuan saya untuk terus mengembangkan potensi diri. Selain aktif dalam kegiatan non akademik seperti seni dan olahraga, saya juga memiliki beberapa prestasi akademik yang hinga sekarang saya jadikan sebagai motivasi. Meskipun lahir dalam keluarga broken home, saya sangat mennyayangi keluarga saya, merekalah yang menjadikan saya seperti sekarang ini.',	'Mimpi terbesar saya adalah menjadi orang yang sukses dan berguna bagi agama, nusa, dan bangsa. Dewasa nanti, saya ingin menjadi Jaksa yang adil dan bertanggung jawab terhadap perkerjaan saya. saua ingin menjadi orang yang berguna bagi orang lain. Cara saya mewujudkan hal ini adalah belajar dengan sungguh-sungguh dan tidak takut untuk mencoba hal baru yang menantang.',	'Saat ini dikampus saya tergabung dalam forum karya dan seni mahasiswa fakultas hukum universitas singaperbangsa karawang, organisasi ini saya jdikan sebagai wadah untuk menyalurkan hobi dan meningkatkan kemampuan diri. Sebagai anak dari seorang ayah yang merupakan pemimpin Lembaga swadaya masyarakat yang bergerak dalam lingkup lingkungan hidup, saya sering ikut dalam berbagai kegiatan mulai dari penanaman pohon mangrove, menjadi relawan pada saat bencana alam. Berpartisipasi dalam kegiatan ini merupakan hal yang sangat berkesan bagi saya, meLalui kegiatan ini saya banyak bertemu dengan orang baru dengan latar belakang yang berbeda dan disetiap cerita hidup mereka memberikan banyak insiprasi bagi saya. ',	1,	1655127651,	NULL,	0),
('SCHLR-WLDNR-45d878',	'USR-WLDNR-08e8c',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654146269,	NULL,	0),
('SCHLR-WLNRK-d53267',	'USR-WLNRK-c1963',	'Wulan Ari kartika',	'2004-04-09',	'8562268720',	'05/03 Kp.Tipar Desa Cimerang kec.Purabaya kab. Sukabumi Jawa Barat',	'Meteorologi Terapan/ FMIPA',	'Institut Pertanian Bogor',	'0.00',	'1',	'Saya adalah mahasiswa baru IPB, sekolah asal SMA negeri 1 kota Sukabumi. Diterima lewat jalur SNMPTN jurusan meteorologi terapan. Hobi mengoleksi buku novel dan melukis, aktif dalam dunia literasi. Empat bersaudara dan ayah seorang wiraswasta.',	'Mimpi terbesar adalah menjadi wanita yang sukses, mandiri dan membanggakan orang tua, cara mewujudkan hal tersebut saya ingin berkuliah dan berkaris setinggi mungkin.',	'Saya aktif didalam dunia literasi sejak SMP. Sering mengikuti kegiatan literasi dan pernah memenangkan perlombaan di ajang festival Candil. Mengikuti ekstrakurikuler Himpunan pelajar pencipta perpustakaan, menjadi Agen literasi Sukabumi, dan mengikuti zambore literasi. Sewaktu SMP aktif didunia Pramuka dan menjadi pratama putri.',	1,	1655376170,	NULL,	0),
('SCHLR-WNDNR-10b2d8',	'USR-WNDNR-2b46b',	'Wanda Nurul Wahida',	'2003-01-03',	'85696649700',	'Janna-Jannaya, Bonto Majannang, Kec. Sinoa, Kab. Bantaeng, Sulawesi Selatan',	'Ekonomi Pembangunan',	'Universitas Hasanuddin',	'3.87',	'4',	'Nama Saya Wanda Nurul Wahida, dan orang-orang memanggil saya Wanda. Saya memiliki minat yang tinggi dalam bidang ekonomi dan bisnis. \r\nSejak duduk di bangku menengah dengan menempuh jurusan akuntansi, saya selalu mencari peluang untuk memulai bisnis. Adapun kegiatan yang pernah saya ikuti untuk memulai adalah program start up. Pada kesempatan tersebut, saya beserta tim menawarkan program pelaporan keuangan koperasi.\r\nTidak berhenti sampai disitu, saya menempuh perguruan tinggi dengan disiplin ilmu ekonomi untuk mempertajam pengetahuan saya terkait minat saya.\r\nKetika waktu luang, saya selalu mengikuti perkembangan isu-isu ekonomi terkini dengan mengikuti webinar ataupun dengan membaca artikel terkait. \r\nSaya juga mengikuti kursus bahasa inggris untuk mengupgrade language skill, karena saya percaya kemampuan bahasa dibutuhkan di manapun dan bidang apapun. ',	'Saya benar-benar ingin menjadi seorang pengusaha yang sukses di usia muda. Untuk itu saya mulai memantapkan goals saya sejak di bangku menengah. Saya yakin bisnis yang besar berawal dari usaha kecil.\r\nUniversitas saya menyediakan program mahasiswa wirausaha dimana semua dapat berpartisipasi. Saya berencana untuk memulai mimpi saya dengan mengikuti program tersebut, dengan mengajukan proposal yang unik dan baik. \r\nKarena program tersebut berbentuk kelompok, untuk itu, pertama-Rama saya harus mencari partner yang juga memiliki motivasi yang sama. Untuk mewujudkan usaha kami juga, tentu saja dibutuhkan banyak persiapan mulai dari menentukan apa yang akan menjadi produk dari ide kami, siapa yang menjadi target pasarnya, apa inovasi dari produk kami, dan apa manfaatnya bagi konsumen. \r\nUntuk mewujudkannya pula tak lupa saya meminta saran dari para senior maupun orang-orang yang telah berpengalaman di bidang ini sebelumnya. ',	'Saya pernah menjadi anggota palang merah ketika duduk di bangku menengah. Hari-hari saya menjadi anggota palang merah adalah pengalaman terbaik. Saya belajar bagaimana memberikan pertolongan pertama pada korban.\r\nNamun selain pembelajaran medis, yang tak kalah menarik adalah bagaimana organisasi mengajarkan untuk saling menghargai sesama  anggota. Kami memegang 7 prinsip dasar palang merah dimana setiap prinsip berpegang pada makna kehidupan. \r\nSaya juga ikut serta pada kegiatan perkemahan yang dilakukan sebagai bentuk belajar bersama antar unit palang merah. Selain menambah pembelajaran, saya juga menambah banyak teman dari kegiatan tersebut.\r\n',	1,	1654243557,	NULL,	0),
('SCHLR-WNDRM-581a03',	'USR-WNDRM-24ac6',	'Winda ramansa',	'2003-11-16',	'83894139786',	'RT09/RW06 Seboro, Sadang, Kebumen, Jawa Tengah, Indonesia ',	'Psikologi Islam ',	'IAIN Salatiga ',	'0',	'0',	'saya adalah mahasiswa baru di IAIN Salatiga yang memiliki cita cita menjadi psikolog, saya sangat suka membaca buku, saya sangat tertarik dengan mental health.',	'mimpi terbesar saya adalah ingin menjadikan Indonesia maju dalam aspek kesehatan mental, saat ini banyak sekali remaja menuju dewasa maupun orang dewasa yang kesulitan dalam menjalani hidup karena kesehatan mental mereka, tetapi terkadang lingkungan sekitar mereka tidak menyadarinya untuk itu saya ingin warga Indonesia paham akan kesehatan mental sendiri maupun orang sekitar, cara untuk mewujudkan impian ini saya ingin membuat komunitas yang melibatkan masyarakat ',	'tidak ',	1,	1654310369,	NULL,	0),
('SCHLR-WNSTS-cf808d',	'USR-WNSTS-9d58b',	'IWAN SUTISNA',	'2003-11-25',	'82113623718',	'Blok. Cijurey, Desa. Kulur, Rt/Rw 24/10, Kec. Majalengka, Kab. Majalengka, Provinsi Jawa Barat',	'S1 Akuntansi',	'Universitas Majalengka',	'3.45',	'1',	'Perkenalkan saya Iwan Sutisna asal Majalengka, saya Mahasiswa Universitas Majalengka jurusan akuntansi. Saya sangat menyukai hal-hal baru dan ',	'Mimpi terbesar saya adalah ingin menjadi seorang akuntan yang hebat dan ingin mendirikan suatu lembaga baik itu pendidikan berupa sekolah, panti asuhan, ataupun perusahaan agar dapat menciptakan peluang kerja bagi masyarakat banyak, karena bagi saya orang sukses itu adalah orang yang dapat bermanfaat bagi orang lain. Cara untuk mewujudkannya yaitu sebagai mahasiswa tentunya belajar dengan sungguh-sungguh baik dalam kelas, oraganisasi, dan lainnya selain itu, mulai investasi atau menabung dari sekarang dan berdo\'a karena usaha tanpa doa adalah suatu hal yang mustahil bagi saya. ',	'Saya mempunyai pengalaman organisasi. Pada saat itu saya adalah wakil ketua OSIS di SMA, saya berada di posisi itu selalu satu tahun. Dalam organisasi saya  tau makna segalanya seperti tanggung jawab, kekompakan, cara menyelesaikan masalah, dapat memahami karakter orang lain, dan lain sebagainya. Dengan organisasi saya dapat mengembangkan diri dan hingga saat ini saya masih menerapkan ilmu yang didapat dalam organisasi. ',	1,	1653607580,	NULL,	0),
('SCHLR-WYFFJ-1d534b',	'USR-WYFFJ-d3025',	'Wyffa Jessica Chandra',	'2002-03-19',	'85781399155',	'Dusun Karajan, Desa Kutajaya RT/RW 002/001, Kec. Kutawaluya, Kab. Karawang, Jawa Barat, 41358',	'Pendidikan Bahasa Inggris',	'UIN Sunan Gunung Djati Bandung',	'2.85',	'2',	'Saya seorang mahasiswa semester 2 di UIN Sunan Gunung Djati Bandung. Saya memiliki kemauan yang besar dalam menggapai cita-cita. Saya memiliki pengalaman di bidang kepenulisan. Saya adalah seorang penulis dan pernah menerbitkan buku fiksi remaja. Hobi saya adalah membaca buku dan menulis. Kegiatan sehari-hari saya selain menjadi seorang mahasiswa, saya juga aktif menulis di beberapa platform kepenulisan. Saya memiliki sikap yang bertanggung jawab, rajin, tekun, ulet, jujur, dan bisa bekerja dengan deadline. Pengalaman saya di dunia kepenulisan sudah hampir 6 tahun. Saya memiliki kemampuan Bahasa Indonesia yang sangat baik dan mempelajari \r\nteknik kepenulisan sesuai kaidah PUEBI. Selain itu, saya juga memiliki kemampuan Bahasa Inggris yang cukup baik. Saya memiliki motivasi yang kuat untuk maju. Saya juga termasuk orang yang sangat kreatif dan inovatif. Saya senang mencari pengalaman dan hal-hal baru. Saya harap dengan mengikuti beasisa YBB Foundation ini bisa membuat mimpi saya terwujud dan bisa menyelesaikan pendidikan saya hingga lulus.',	'Mimpi terbesar saya adalah menjadi seorang penulis terkenal yang memiliki banyak karya. Saya ingin menerbitkan banyak buku. Selain itu, mimpi besar saya ingin melanjutkan pendidikan hingga ke jenjang S2. Saya ingin bisa menjadi seorang dosen. Ada banyak mimpi yang ingin saya wujudkan. Cara saya untuk mewujudkan mimpi saya adalah dengan terus berusaha, berdoa, dan bekerja keras. Pertama, karena saya ingin menjadi penulis, maka saya terus berkarya saat ini dan berusaha untuk menerbitkan buku lagi. Kedua, karena saya ingin menjadi dosen, maka saya harus menyelesaikan pendidikan saya dengan baik, mengikuti setiap pelajaran di kampus, mencari banyak pengalaman, lulus tepat waktu, dan melanjutkan pendidikan ke jenjang S2. Saya harap semua mimpi-mimpi saya bisa terwujud dan saya tidak akan menyerah untuk menggapai cita-cita.',	'Saya memiliki pengalaman di bidang organisasi. Saat SMA, saya menjadi anggota organisasi MPK. Saya sering menjadi panitia perlombaan di sekolah dan mengikuti berbagai kegiatan organisasi. Selain itu, saya pernah menjadi seorang relawan dalam sebuah seminar. Saya menjadi pemateri di beberapa seminar kepenulisan.',	1,	1654440350,	NULL,	0),
('SCHLR-XCLSS-86cb1d',	'USR-XCLSS-facb5',	'Excelsis resmel noija',	'2003-04-10',	'82397076716',	'Jln. Dr. Kayadoe, kudamati, lorong spk',	'Teknik mesin/ Teknik',	'Pattimura',	'3.68',	'1',	'Saya seorang yang rajin, senang bergaul dan menyukai hal baru',	'Mimpi terbesar saya menjadi seorang dosen, cara saya mewujudkannya adalah dengan giat belajar dan pantang menyerah',	'Tidak',	1,	1653661770,	NULL,	0),
('SCHLR-YDNTN-940c3a',	'USR-YDNTN-eb987',	'YUDIANTO NGGABA HAMBA BANJU',	'1999-10-10',	'82147626514',	'Laihandang, Rt/Rw: 008/003, Kel/Desa: Watuhadang, Kecamatan: Umalulu, Provinsi NTT',	'Teknologi Hasil Perikanan/Sain',	'Universitas Kristen Wira Wacan',	'3.47',	'2',	'Nama saya Yudianto Nggaba Hamba Banju, saya lahir pada tanggal 10 Oktober 1999, seya berasal dari keluarga yang sederhana dengan pekerjaan kedua orang tua saya sebagai petani dengan penghasilan perbulannya kurang 1.000.000 jt. Tujuan saya mendaftar beasiswa ini adalah untuk mengurangi beban kedua orang tua saya dalam membayar uang perkuliahan saya, mengapa saya layak mendapatkan beasiswa ini karena saya sebagai seorang pelajar berhak mendapatkan pendidikan setinggi-tingginya dan dengan bantuan beasiswa ini cita cita saya dapat terwujudkan. ',	'Salah satu yang menjadi mimpi terbesar saya adalah dapat bermanfaat bagi banyak orang baik dalam suatu organisasi maupun dalam lingkungan masyarakat, untuk mewujudkannya ialah dengan cara terus belajar dan belajar.',	'Tidak',	1,	1653530346,	NULL,	0),
('SCHLR-YLFTH-e63872',	'USR-YLFTH-9646e',	'YULIA FATHMAH ALKHULUQ',	'2003-07-11',	'88296511276',	'Kp. Cibojong Rt 02 Rw 06 Des. Jayabakti Kec. Cidahu Kab. Sukabumi Prov. Jawa Barat Kode Pos 43358',	'Dirasat Islamiyah',	'UIN Syarif Hidayatullah Jakart',	'4.00',	'2',	'Saya mempunyai kepribadian introvet, dimana saya takut untuk bertemu dengan orang banyak di dunia ini. Saya berusaha untuk menghindari sifat ini dari diri saya walaupun sulit sekali untuk merubahnya.\r\nSaya juga terlahir dari keluarga yang sangat sederhana, mungkin dalam segi ekonomi kurang mencukupi, akan tetapi orang tua saya sangat mendukung impian saya. Saya berkuliah bukan dengan beasiswa seperti orang pintar pada umumnya. Saya hanya mengandalkan gaji orang tua saya. Saya merasa egois karena orang tua saya terutama ayah harus banting tulang sampai rela pulang malam hari agar saya bisa berkuliah, sehingga orang tua saya harus dirawat di RS. \r\nHal itu membuat saya mengiris hati yang paling dalam, sakit sekali rasanya.\r\nJikalau ada yang bertanya, Mengapa saya kuliah? Saya akan Jawab orang tua saya yang menginginkan anaknya lebih baik darinya. \r\nPada semester 1 k3maren saya sempat berpikir untuk tidak lanjut kuliah karena masalah krisis ekonomi, tetapi tidak jadi karena orang tua saya berjuang untuk mendapatkan sepeser uang untuk bayar UKT kuliah. \r\nSaya menangis, karena memang itu takdir Allah yang terjadi pada saya, saya memang ditawarkan oleh guru saya untuk kuliah di luar negeri. Tapi orang tua saya tidak mengizinkannya.\r\nSaya terima kepahitan dalam hidup saya, saya yakin bahwa Allah punya rencana yang lebih baik untuk saya dimasa depan.\r\nSaya seorang yang berprestasi dari SD sampai SMA itu membuat saya belum cukup untuk membahagiakan orang tua dan  diri saya juga. Karena prestasi bukan segalanya, menurut saya itu merupakan suatu takdir Allah yang ditetapkan untuk saya.\r\nSaya berterima kasih kepada Allah, atas semua kenikmatan yang luar biasa. Dimana semua orang tidak bisa merasakannya, saya bangga dengan orang tua saya\r\nThanks to God Allah SWT\r\nAnd i love you mom and girl',	'Saya ingin menginspirasi banyak orang lewat perjuangan selama saya hidup di dunia ini, tak banyak yang saya inginkan akan tetapi jika yakin Allah yang akan mengabulkan permohonan semua hambanya. Saya akan belajar dengan tekun dan rajin. Tak lupa dengan berdoa dan bersyukur kepada Allah SWT',	'Saya pernah menjadi sekretaris umum di pondok pesantren dan menjadi ketua Bagian Ibadah. Itu menurut saya menjadi suatu pembelajaran dan juga amanah yang diberikan bagi kepribadian saya. Amazing sekali rasanya mengemban itu semua disaat Self health saya sedang tidak baik-baik saja.',	1,	1653555731,	NULL,	0),
('SCHLR-YLNLS-9872c8',	'USR-YLNLS-d9fe0',	'Yuliana Liska Savitri',	'2002-07-31',	'85213534285',	'Turi, Sleman, Daerah Istimewa Yogyakarta',	'Akuntansi',	'Universitas Mercu Buana Yogyak',	'3.97',	'2',	'Saya adalah mahasiswi semester 2 dengan Program Studi Akuntansi di Fakultas Ekonomi. Saya mudah beradaptasi dan menyukai sesuatu hal yang baru, mampu bekerja mandiri maupun dalam tim, bertanggung jawab dan memiliki semangat yang tinggi.',	'Mimpi terbesar saya yaitu ingin menyekolahkan kedua adik saya setinggi mungkin sesuai dengan passion mereka dan ingin menghidupi keluarga saya agar bisa berkecukupan. Saya ingin membuka lapangan pekerjaan yang nantinya bisa bermanfaat untuk diri saya sendiri dan orang disekitar saya, terlebih lagi bisa dijangkau oleh orang dengan skala yang luas. Cara saya untuk mewujudkan impian itu adalah dengan selalu berusaha mengembangkan potensi dan skill yang dinilai berguna untuk masa yang akan datang serta berusaha menambah relasi yang positif tidak lupa juga disertai dengan doa kepada Allah SWT.',	'Saat ini saya masih bergabung ke dalam program volunteering yang diadakan oleh Scholarship4us (Beasiswa Untuk Kita) yang rencananya dilaksanakan selama 7 bulan (saat ini telah berjalan selama 3 bulan). Disini saya terpilih ke dalam divisi partnership, yang mengharuskan saya untuk menjalin kerja sama dan bertanggung jawab dalam segala hal mengenai media partner. Masing-masing anggota diberikan tugas untuk mencari minimal 1 media partner untuk setiap kegiatan yang akan dilaksanakan. Dan tugas pertama  itu telah berhasil saya lakukan, dan saya harapkan bisa berkontribusi lebih baik lagi.',	1,	1655688593,	NULL,	0),
('SCHLR-YLNMR-e3ea10',	'USR-YLNMR-753a6',	'Yulion mirin',	'2006-07-04',	'81283753288',	'MELAYA, Bali',	'MIPA',	'SMAN 1 Melaya',	'3.95',	'1',	'Hallo YBB perkenalkan nama saya yulion dari Papua dan saya juga suka organisasi, saya saat ini merantau ke Bali untuk sekolah,usia saya 16 tahun dan saya saat ini duduk di bangku SMA kelas 11',	'Ada banyak mimpi tetapi salah satu mimpi saya yang besar adalah pemimpin yang hebat, dan untuk menggapai saya berusaha merantau ke Bali untuk mendapatkan pendidikan layak',	'Saya terbilang pengalaman berorganisasi\r\n\r\n* Anggota OSIS \r\n*PIK-R\r\n* Ketua umum adem provinsi Papua dan Papua barat se-provinsi Bali\r\n*Panitia konferensi internasional GYC global yout confrence 2022( masih aktif)\r\n',	1,	1655613807,	NULL,	0),
('SCHLR-YLNSM-b7eb27',	'USR-YLNSM-c5e31',	'Yuliana Asmaranda Nainggolan',	'2002-07-14',	'82273097652',	'Jln.Linkar timur kampus Udayana, Jimbaran Kecamatan Kuta Selatan, Kabupaten Badung, Provinsi Bali',	'Agroekoteknologi',	'Universitas Udayana',	'3.74',	'4',	'Saya itu adalah orang yang suka mencoba hal baru',	'Mimpi terbesar saya adalah membuat orang tua dan keluarga saya bangga dengan apa yang saya lakukan untuk mendapatkan impian saya itu saya selalu berusaha belajar dengan tekun dan pantang menyerah',	'Saya mempunyai pengalaman berorganisasi keagamaan di sana saya didik untuk saling peduli terhadap lingkungan dan sesama manusia, untuk relawan saya juga pernah ikut jadi rewalan membantu para petani yang terdampak pandemic sehingga hasil panen nya tidak dapat dijual dengan harga yang tinggi',	1,	1654341322,	NULL,	0),
('SCHLR-YLRCH-3a1b2e',	'USR-YLRCH-19560',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654517160,	NULL,	0),
('SCHLR-YLTRS-3dfadf',	'USR-YLTRS-17ef9',	'Yulia Tri Septiani',	'2002-09-11',	'81328882763',	'Karangmojo, RT/RW 07/02 Tasikmadu, Karanganyar, Jawa Tengah',	'Teknik Kimia/Teknik',	'Universitas Sebelas Maret ',	'3.79',	'2',	'Saya Yulia Tri Septiani, seorang mahasiswi semester 2 jurusan Teknik Kimia, Fakultas Teknik, Universitas Sebelas Maret. Usia saya saat ini 19 tahun dan menjadi mahasiswa aktif. Saya berdomisili di Kabupaten Karanganyar Provinsi Jawa Tengah.',	'Mimpi terbesar saya adalah menjadi seorang engineer sukses dan menjadi CEO industri food and beverage dengan cabang di seluruh dunia. Cara saya mewujudkannya dengan menggali potensi diri saya, belajar dengan tekun di prodi yang saya jalani saat ini, menerapkan ilmu-ilmunya serta beribadah dengan rajin.',	'Saya pernah menulis puisi dan karya saya menjadi salah satu karya yang dibukukan dalam puisi berjudul \"LINTANG\". Pengalaman organisasi saya yaitu menjadi staff di bidang POSDM di Himpunan Mahasiswa Teknik Kimia, menjadi bendahara di karangtaruna, menjadi PJ angkatan (ketua angkatan) selama 3 bulan, moderator pada acara Sharing is Caring 2, Sekretaris Proker Intensive Class selama 1 semester, menjadi salah satu penyusun artikel Chemagz (Chemical Magazine), menjadi koor mentor ospek jurusan tahun 2022, dan menjadi staff medis di event INSTING 2022, menjadi staff divisi essay pada CERC (Chemical Engineering Research Club)',	1,	1653983220,	NULL,	0),
('SCHLR-YMNLS-05ebc5',	'USR-YMNLS-75961',	'Yumna Lestari',	'2001-11-29',	'83199793808',	'Jl. Gondang Barat I No. 1B, Kel. Tembalang, Kec. Tembalang, Kota Semarang, Jawa Tengah',	'Manajemen Sumberdaya Perairan',	'Universitas Diponegoro',	'3.52',	'4',	'Saya merupakan seorang yang ramah dan penyabar. Selain itu, saya merupakan sosok pekerja keras yang dapat mempertanggungjawabkan pekerjaannya.',	'Mimpi terbesar saya adalah membahagiakan kedua orang tua saya. Meskipun hal ini juga merupakan impian dari semua orang, namun saya selalu mengedepankan kebahagiaan orang tua saya bagaimanapun caranya. Saat ini, hal yang dapat saya lakukan untuk membahagiakan orang tua saya adalah dengan cara belajar dengan giat dan mendapatkan hasil yang baik. Namun tidak cukup dengan hal tersebut, saya masih harus terus berusaha agar saya dapat terus membahagiakannya.',	'Saat ini, saya merupakan bagian dari organisasi himpunan mahasiswa departemen saya, yaitu Himasaka. Posisi saya di organisasi tersebut adalah sebagai staff ahli di bidang keorganisasian dan sumberdaya mahasiswa. ',	1,	1655727950,	NULL,	0),
('SCHLR-YMNLS-3d40fd',	'USR-YMNLS-3216a',	'Yumna Lestari',	'2001-11-29',	'83199793808',	'Jl. Gondang Barat I, No. 1B, Kelurahan Tembalang, Kecamatan Tembalang, Kota Semarang, Jawa Tengah',	'Manajemen Sumberdaya Perairan',	'Universitas Diponegoro',	'3.52',	'4',	'Saya merupakan seseorang yang ramah dan mudah bergaul. Saya juga merupakan pribadi yang penyabar dan pekerja keras.',	'Mimpi terbesar saya adalah membahagiakan kedua orang tua saya. Cara mewujudkannya yaitu dengan saya belajar dengan giat dan tidak mengecewakan orang tua. Saya akan berusaha sekuat tenaga saya agar saya dapat menjadi orang yang bermanfaat bagi orang lain.',	'Saya merupakan bagian dari organisasi yang ada di kampus saya, yaitu himpunan mahasiswa jurusan. Di dalam organisasi yang bernama Himasaka tersebut, saya menjadi staff ahli dalam bidang keorganisasian dan pengembangan sumberdaya manusia.',	1,	1655476943,	NULL,	0),
('SCHLR-YMNZL-6a014b',	'USR-YMNZL-866e4',	'Yumna Zaul',	'2003-02-27',	'83159464255',	'Perum Gentan B. 4 Kumbulan RT 3 RW 10, Gentan, Bendosari, Sukoharjo',	'Pend. Bahasa dan Sastra Indone',	'Universitas Sebelas Maret ',	'3.76',	'2',	'Nama saya Yumna Zaul, mahasiswa semester 2 prodi Pendidikan Bahasa dan Sastra Indonesia FKIP UNS. Memiliki hobi menulis puisi, cerpen, dan bermain gitar. ',	'Mimpi terbesar saya adalah membuat orang tua saya bangga. Cara mewujudkannya yaitu dengan berkuliah sungguh-sungguh dan lulus dengan IPK yang memuaskan berpredikat cumlaude kemudian memasuki dunia kerja dengan pekerjaan yang sesuai dengan passion saya.',	'Ya. Saya pernah menjadi volunteer pada kegiatan mengajar di kota tempat tinggal saya. Saya dan teman-teman lain mengajar di sebuah sekolah dasar yang berada di desa yang cukup jauh dari perkotaan. Saya terkejud karena 1 kelas hanya berisi 5 sampai 11 siswa.\r\n\r\nSelain itu, saya juga pernah mengikuti organisasi paduan suara, menjadi panitia lomba paduan suara se-eks karesidenan Surakarta, juga mengikuti organisasi taekwondo.',	1,	1653983792,	NULL,	0),
('SCHLR-YNML-4616c3',	'USR-YNML-3bc2e9',	'Yena Amalia',	'2002-10-05',	'82279753653',	'Jl. RA Kartini, Desa Bumi Mulya, RT/RW 002/002, Kecamatan Penarik, Kabupaten MUKOMUKO, Provinsi Bengkulu ',	'Mikrobiologi Pertanian ',	'Universitas Gadjah Mada ',	'3.47',	'2',	'aku orang yang disiplin waktu, tanggung jawab, dan jujur. Aku selalu mengingat pesan kedua orang tua yaitu jangan pernah sombong dan selalu membantu orang lain walapun diri kamu sendiri mengalami kesusahan. Selalu rajin beribadah dan berdoa karena Tuhan Yang Maha Esa telah merencanakan ini sesuai kemmapuan ku ',	'Lulus dengan cepat dan menjadi lulusan yang terbaik. Cara yang aku tempuh yaitu dengan belajar sungguh sungguh dan berdoa serta rajin beribadah. Tidak lupa meminta restu kedua orang tua, karena ridha orang tua adalah ridhanya Allah SWT. ',	'iya, saya sebagai ketua forum keluarga di organisasi KMMP fakultas Pertanian 2022, menjadi staff PSDM di PERMAHAMI Mikrobiologi dan di KAB Fakultas Pertanian, staff Sarana dan Prasarana UKM PANAHAN UGM serta menjadi panitia UGM OPEN 2022 di bidang staff sarana dan prasarana, dan menjadi SEKBEND di Kementrian RISET BEM KM Fakultas Pertanian 2022 ',	1,	1654941207,	NULL,	0),
('SCHLR-YNRPS-3da6d1',	'USR-YNRPS-21ed7',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654079864,	NULL,	0),
('SCHLR-YSFTD-3b683c',	'USR-YSFTD-2ccca',	'Yosafat Dedisius',	'2001-11-27',	'81256238745',	'Jl. Raya Desa Kapur, Komplek Spring Park no D9, RT03 RW03, Kelurahan Mekar Baru, Sungai Raya, Kubu Raya, Kalbar',	'Sosial Ekonomi Pertanian/Agrib',	'Universitas Tanjungpura Pontia',	'3.05',	'2',	'Perkenalkan nama saya Yosafat Dedisius, biasa dipanggil Dedi. Saya Lahir di Gunung Tamang, 27 November 2001. Usia saya saat ini 20 tahun. Saya berasal dari desa Gunung Tamang, Kec. Sungai Raya, Kab. Kubu Raya, Kalimantan Barat.\r\nSaya merupakan anak keempat dari empat bersaudara. Ayah saya bernama Alfonsius Martinus (Almarhum) berprofesi sebagai petani dan ibu saya bernama Margareta Anting, berprofesi sebagai petani. Saat ini yang membiayai kuliah saya ada kakak saya dengan segala keterbatasan yang ada tetapi tidak menyurutkan semangat saya untuk tetap menimba ilmu dan giat belajar.\r\nSejak SMA saya sudah sangat bercita-cita ingin kuliah. Hal ini didorong dengan lingkungan teman-teman saya yang semuanya ingin kuliah, pengalaman dari tetangga yang sudah kuliah serta keinginan terbesar dari keluarga. Dukungan keluargalah yang membuat saya menjadi optimis untuk bisa mewujudkan hal tersebut. \r\nKondisi ekonomi keluarga saya tidak memungkinkan dan penghasilan kakak saya yang terbilang pas-pasan dan kebetulan juga mereka sudah berkeluarga sehingga banyak tanggungan yang harus mereka hadapi terutama biaya sekolah anak mereka dan biaya kuliah saya. Akan tetapi karena motivasi dalam diri saya dan dukungan dari kakak, ibu, serta teman disekitar saya membuat saya mampu bertahan di semester 2 perkuliahan saat ini.',	'Mimpi terbesar saya ialah saya ingin menjadi sosok yang bisa menginspirasi, memotivasi dan dan mengedukasi banyak orang serta memberikan manfaat dan pengaruh positif bagi orang lain terutama para pelajar dengan berbagai ilmu, skill maupun pengalaman yang saya miliki. \r\n\r\nCara yang bisa saya lakukan untuk mewujudkannya ialah dengan memanfaatkan sebaik-baiknya masa kuliah saya saat ini dengan mengikuti berbagai kegiatan organisasi, pelatihan, pengembangan diri yang bisa melatih softskill saya. \r\nSaya harap dengan mengikuti kegiatan tersebut bisa memberikan saya ilmu yang bermanfaat dan bisa saya kembangkan. ',	'Saat ini saya aktif di organisasi jurusan (himpunan mahasiswa jurusan) pada bidang sosial ekonomi pertanian . Saya sebagai kepala bidang di bidang tersebut dengan tugas merencanakan kegiatan, pelatihan dan juga upgrading skill untuk anggota. Tujuan saya ikut organisasi adalah selain melatih softskill dan leadership, juga sebagai ajang untuk berbagi ilmu yang sudah dapatkan dan sudah saya terapkan.\r\nSelain itu juga, saya aktif di organisasi keagamaan yaitu Ikatan Mahasiswa Katolik Fakultas Pertanian Universitas Tanjungpura (IMAKULATA UNTAN), dimana organisasi tersebut menjadi wadah bagi saya untuk saling mengenal sesama mahasiswa dan bersama- membina iman dan tentunya melatih softskill penting lainnya.',	1,	1654537200,	NULL,	0),
('SCHLR-YSNNV-1b9b56',	'USR-YSNNV-2b555',	'yesiana novera kurnianto',	'2001-11-27',	'85800474666',	'jl.brigjen katamso gang teratai no.4',	'perpustakaan/sastra indonesia',	'universitas negeri malang',	'3.71',	'4',	'saya adalah anak ke 2 dari 2 bersaudara , yang dibesarkan seorang single mom . saya orang yg ambisius dalam mengerjakan suatu hal,mengerjakan sesuatu dengan plan yg sudah direncakan sebelumnya.namun terkadang juga suka melakukan hal diluar plan,karena itu suatu tantangan bagi saya.',	'saya ingin menjadi orang yg berguna bagi sekitar terutama keluarga saya dlm hal ekonomi,untuk itu saya serius berpendidikan supaya kelak mendapat pekerjaan yg sesuai dengan keinginan saya. semoga saya terpilih mendapatkan beasiswa ini supaya bisa melanjutkan kuliah sampai lulus tepat waktu ',	'punya . saya pernah ikut organisasi kota yaitu dewan perwakilan anak,yakni organisasi yg memberikan wadah untuk anak anak menyampaikan keluh kesahnya dan juga melindungi hak anak',	1,	1654585506,	NULL,	0),
('SCHLR-YSNNV-592f9b',	'USR-YSNNV-2b555',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654584893,	NULL,	0),
