('SCHLR-ZHNNR-e731fb',	'USR-ZHNNR-2a0ab',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1654019568,	NULL,	0),
('SCHLR-ZHRDL-5b0560',	'USR-ZHRDL-6aff1',	'Zahra Dellaviana Zaki',	'2003-01-03',	'81231250822',	'Nirwana estate blok u 40 cibinong',	'Manajemen',	'Universitas Gunadarma',	'3.80',	'1',	'Saya adalah seorang mahasiswa yang ingin sekali mendapatkan beasiswa untuk membanggakan kedua orang tua saya. Saya ingin sekali sukses diumur saya yang masi terbilang muda ini. Hobby saya mengedit atau mendesign meskipun saya rasa itu masi kurang tetapi saya tidak pernah berhenti untuk terus belajar dan tidak pernah berhenti untuk mengembangkan apa yang saya punya dalam diri saya.',	'Saya ingin sekali menjadi conten creator dan pengusaha muda. Cara saya agar dapat mewujudkan itu semua adalah dengan belajar dan selalu berdoa. Dan jangan mudah menyerah.',	'Pada saat saya SMP kelas 9 saya mengikuti organisasi yaitu sebagai anggota osis dan saya mengikuti ekstrakulikuler pramuka yang wajib. Setelah saya SMA saya juga mendapatkan tanggung jawab sebagai ketua ekstrakulikuler jurnalis. Dan pada saat saya memasuki dunia perkuliahan saya mengikuti ukm kpm (korps protokoler mahasiswa) di universitas telkom dan juga saya mengikuti ukm comma design di universitas gunadarma',	1,	1654243179,	NULL,	0),
('SCHLR-ZHRFB-50de8b',	'USR-ZHRFB-48f4d',	'Zahraa Febria Salsabila',	'2001-02-10',	'895401605662',	'Perumahan Pinang Permai A-1 Denpasar',	'Pendidikan Guru Pendidikan Ana',	'Universitas Negeri Malang',	'3.89',	'4',	'Saya merupakan Mahasiswa semester empat program studi Pendidikan Guru Pendidikan Anak Usia Dini di Universitas Negeri Malang. Sebagai seorang pendidik saya memiliki minat yang tinggi terhadap kesejahteraan manusia, khususnya pada bidang pendidikan. Pada beberapa tahun terakhir saya mendedikasikan diri saya untuk bergabung pada beberapa komunitas yang berfokus pada kemajuan bidang tersebut. Selain itu saya juga tertarik pada bidang public speaking dan relation yang dimana akan sangat penting pada pendidikan abad 21 mendatang.',	'Saat ini saya sedang menempuh pendidikan pada bidang keguruan dimana tentunya hal ini merupakan salah satu mimpi besar saya yakni menjadi seorang guru disamping itu saya juga ingin menjadi seorang pengusaha muda yang sukses dan bermanfaat bagi orang banyak, beberapa cara untuk mewujudkan hal tersebut yakni saya memulai untuk mengikuti beberapa komunitas yang menjurus pada bidang pendidikan seperti komunitas mengajar di kampus saya, dimana hal itu dapat menjadikan latihan bagi saya untuk nantinya dapat terjun langsung menjadi seorang guru. Sedangkan cara saya untuk mewujudkan menjadi seorang pengusaha yakni dengan mengikuti beberapa webinar atau pelatihan yang diadakan oleh pemerintah ataupun platform di sosial media sebagai sarana saya untuk memperdalam ilmu mengenai enterpreneurship, selain itu saya juga membiasakan untuk membantu ibu saya yang berjualan kue, dimana hal ini juga dapat melatih dan meningkatkan saya dalam pada bidang enterpreneurship ini. Dan mimpi besar saya yang terakhir yakni saya ingin sekali bergabung dalam volunteer kemanusiaan seperti volunteer dalam ketika ada bencana alam. Salah satu cara untuk mewujudkan itu yakni saya seringkali mencoba untuk mendaftar ketika terdapat platform yang sedang open recruitment tetapi sampai saat ini memang belum rezeki saya untuk bergabung pada beberapa volunteering tersebut, tetapi ketika ada open recruitment volunteer yang tidak dibatasi saya seringkali bergabung, seperti volunteer membersihkan pantai dan pembagian makanan kepada masyarakat.',	'Ya, saya memiliki. Terdapat beberapa pengalaman organisasi ataupun relawan selama saya berkuliah saat ini. Yang pertama yakni HMJ KSDP UM, di periode pertama saya bergabung pada organisasi ini saya menjabat sebagai anggota hubungan organisasi atau biasa dikenal dengan humas, sedangkan di periode kedua yakni saat ini, saya menjabat sebagai Sekretaris Umum. Yang kedua yakni YBB Turkishschool disini saya menjabat sebagai anggota intership pada tim event,  periode internship disini hanya selama 3 bulan dan diakhir saya mendapat predikat A. Yang ketiga, saya bergabung pada beberapa volunteer diantara menjadi tim event pada acara BMC Summit yang diadakan oleh Komunitas Imconnect Bandung , dan saat ini saya masih bergabung di dalamnya. \r\nDan yang terakhir, untuk pengalaman relawan saya hanya pernah bergabung dalam acara bersih bersih pantai di Bali yang diselenggarakan oleh komunitas Cakra Abhiphraya.',	1,	1655735862,	NULL,	0),
('SCHLR-ZKKYH-e8c326',	'USR-ZKKYH-08367',	'Zakkiyah Istifa Rahmasanty',	'2002-01-16',	'87766951720',	'Jl. Raya Ceweng No. 45 Kecamatan Diwek Kabupaten Jombang Provinsi Jawa Timur',	'Psikologi',	'Universitas Sebelas Maret',	'3.62',	'2',	'Saya memiliki kepribadian ENTP dimana menggambarkan saya seorang idea maker. Saya cenderung mudah atau fleksibel dalam beradaptasi, memiliki semangat dan antusiasme yang tinggi untuk mencoba hal baru dan menularkan ide kepada sekitar. Saya memiliki kemampuan yang cukup untuk berkomunikasi dengan baik dan memiliki ketertarikan besar untuk  bergabung dalam program beasiswa YBB baik untuk membantu biaya kuliah saya maupun mengembangkan softskill saya dari benefit program ini. ',	'Tentunya, mimpi terbesar dan utama saya yaitu dapat menyelesaikan kuliah S1 hingga berlanjut kejenjang berikutnya dengan nilai terbaik dan dengan waktu secepat mungkin. Kemudian, selama keberjalanan kuliah, saya ingin dapat menerapkan dan membagikan apa yang saya dapatkan dibangku kuliah kepada sekitar saya sekecil apapun itu dan berlanjut mendapatkan pekerjaan yang sesuai dengan bidang dan minat saya. Dalam rangkain ini, versi terbaik saya akan terbentuk dan dapat memberikan yang terbaik untuk orang tua saya, keluarga besar, masyarakat sekitar maupun bangsa saya sendiri.',	'Saya mulai menggeluti dunia organisasi dan kepanitian ini saat saya duduk di bangku perkuliahan. Pengalaman organisasi yang saya geluti yakni :\r\n1. Staff BEM FK UNS\r\n2. Staff HIMAPSI UNS\r\n3. Staff SKI FK UNS\r\nPengalaman Kepanitiaan:\r\n1. Staff PDD Webinar Finansial \r\n2. Staff Dansum Archetype 6.0\r\n3. Staff Publikasi Metamorphosa 13\r\n',	1,	1655742536,	NULL,	0),
('SCHLR-ZLFDL-077ab4',	'USR-ZLFDL-a421c',	'Zulfa Della Affifah',	'2003-06-21',	'81380901214',	'Jalan Taruna Gg. 4 No. 26A Jakarta Pusat',	'Pendidikan Guru Sekolah Dasar',	'Universitas Muhammadiyah Prof.',	'3.90',	'2',	'Saya seorang mahasiswi jurusan pendidikan guru sekolah dasar yang berminat pada bidang politik, alam, lingkungan sosial. Saya mampu membagi waktu antara kerja, membantu orang tua, organisasi, dan kuliah. Saya senang berbicara dengan orang lain. Saya senang mengeksplor hal-hal yang baru, seperti pada sebelumnya saya tidak pernah menjadi ketua pada organisasi, dan saat ini saya sedang mendaftar menjadi ketua umum HIMA PGSD. Saya mampu bekerja dalam tim. Hal ini dapat dibuktikan dengan tugas kelompok selama kuliah selalu mendapat nilai yang baik, dan saya mampu berkoordinasi dengan teman-teman didalam kelompok. Saya mudah penasaran dengan hal-hal baru yang dapat menambah wawasan.',	'Mimpi terbesar saya selama masa kuliah yaitu mendapatkan beasiswa. Ketika saya mendapatkan beasiswa hal tersebut termasuk kedalam membanggakan kedua orang tua saya. Dengan mendapat beasiswa, saya juga membantu kedua orang tua. Cara mewujudkan mimpi mendapat beasiswa yaitu saya terus mencoba untuk mendaftar beasiswa yang menunjang kriteria saya saat ini, seperti contoh pada beasiswa The Youth Break The Boundaries. Kemudian, mimpi terbesar setelah kuliah yaitu menjadi guru yang dapat menginspirasi segala kalangan usia. Saya ingin membantu anak-anak yang kurang beruntung dalam menunjang pendidikan. Saya senang berinteraksi dengan anak-anak. Saat ini, saya berusaha mempelajari materi kuliah dengan baik dan menikmati setiap momen perkuliahan, agar materi yang saya dapatkan kelak membawa saya menjadi guru yang menginspirasi.',	'Saya memiliki pengalaman organisasi. Saat duduk dibangku SMP saya bergabung dengan OSIS dan melaksanakan program kerja, salah satunya bazar. Posisi yang saya dapatkan yaitu humas. Saya sebagai penghubung antara panitia bazar dengan peserta bazar. Saya bertugas mengkonfirmasi ketersediaan stok dalam bazar, membagi hasil, dan mengecek kedatangan barang-barang saat bazar. Tentunya, tugas yang saya dapatkan membutuhkan ketelitian. Dan acara bazar saat SMP tersebut sukses hingga mendapatkan omset cukup besar.\r\n\r\nKemudian, saat dibangku SMA. Saya menjadi volunteer event yang diadakan oleh SMA saya. Yaitu Spatsa CUP. Posisi yang saya dapatkan yaitu menjadi Liaison Officer. Hampir mirip seperti humas. Saya sebagai penghubung interaksi antar penitia event dengan peserta lomba. Saya mendapatkan jadwal peserta lomba yang bertanding. Lalu, saya menghubungi mereka. Kemudian, pendaftaran, denda, konfirmasi kehadiran, penyerahan hadiah, segala hal yang menjadi perhubung panitia event dengan peserta lomba saya lakukan. Menjadi Liaison Officer tentunya dibutuhkan kesabaran, selain kesabaran, dibutuhkan ketelitian, gesit, dan cekatan untuk menyampaikan informasi dan koordinasi antar peserta lomba. Dalam acara Spatsa CUP ini, saya juga bertugas sebagai MC untuk menutup acara. Menjadi MC merupakan pengalaman luar biasa, berawal dari saya yang ragu untuk public speaking, kemudian berlatih karena mendapatkan tugas menjadi MC. Hingga sekarang, menjadikan saya mampu untuk berbicara didepan umum untuk mengemukakan pendapat.\r\n\r\nYang terakhir, saat kuliah saya bergabung dengan organisasi Himpunan Mahasiswa atau HIMA. Pada HIMA, saya mendapatkan pengalaman yang berlimpah, seperti bergabung pada webinar nasional, mengikuti lomba debat dan mendapatkan juara 3. Selain itu, terdapat program kerja HIMA yang bernama Direct Quality. Program ini mencakup perlombaan mulai dari sekolah dasar hingga mahasiswa umum. Pada program ini saya sebagai divisi sponsor. Saya bekerja dalam tim untuk mendapatkan sponsor, mengirim proposal pengajuan, dan lain-lain. Kemudian, kami melakukan dana usaha dengan cara berjualan. Selain mendapatkan ilmu teori, saya mendapatkan strategi marketing langsung dilapangan. Saya mendapatkan pengalaman bagaimana berjualan, bagaimana pemasaran produk agar konsumen dapat tertarik. Dan yang terakhir tentunya saya mendapatkan ilmu cara mengalokasi perhitungan dana untuk kegiatan. Saat ini, saya sedang proses untuk mendaftarkan diri sebagai ketua umum HIMA PGSD periode 2022/2023.',	1,	1655561151,	NULL,	0),
('SCHLR-ZLFDN-994239',	'USR-ZLFDN-6d7ed',	'Zulfa Diana',	'2002-03-27',	'81231610477',	'Jl.Mayjend Sutoyo,No.28,Cekok,Babadan,Ponorogo,Jawa Timur',	'Psikologi/Psikologi/Psikologi',	'UIN Maulana Malik Ibrahim Mala',	'3.88',	'1',	'Aku adalah seseorang perempuan yang beranjak dewasa dengan berbagai mimpi yang mengisi kepalaku. Aku merupakan seseorang yang pekerja keras,berambisi dalam meraih mimpi,memiliki niat yang kuat,rajin,bertekad tinggi,tidak gampang menyerah,dan mempunyai jiwa sosial yang tinggi. Terkadang aku kurang teliti dalam mengerjakan sesuatu tapi aku mempunyai solusi untuk menyelesaikannya dengan membuat catatan kecil atau alarm sebagai pengingat.',	' Salah satu mimpi terbesarku adalah melanjutkan kuliah S2 di universitas dalam atau luar negri dengan bebas biaya atau dengan beasiswa. Sekarang aku masih mencari informasi untuk menentukan kampus mana yang akan menjadi pilihanku. Karena S2 memerlukan skor TOEFL, tahun lalu pada saat aku gap year, aku mengambil kursus bahasa Inggris di Kampung Inggris dan aku akan terus belajar untuk itu. Selanjutnya aku akan memperluas relasiku dengan mengikuti organisasi dan tetap mempertahankan IPK atau hasil akhir dalam kuliah agar tetap tinggi. Bagiku mengikuti YBB Scholarship ini adalah salah satu bagian dalam mewujudkan mimpiku, disini aku bisa mengembangkan potensi diri, menambah relasi dan pengetahuan dan sangat sayang untuk dilewatkan kesempatan emas ini.',	'Saat SMP dan SMA aku mengikuti organisasi kepramukaan, ini selaras dengan jiwa sosialku yang tinggi. Di lingkungan rumah aku mengikuti organisasi masyarakat remaja putri Nahdlatul Ulama atau disebut IPPNU, dalam organisasi tersebut sering mengadakan kegiatan keagamaan seperti memperingati hai Maulid Nabi Muhammad Saw, latihan seni agama Islam seperti barjanzi,mengadakan lomba untuk anak-anak di lingkungan desa,dan banyak hal positif lainnya.',	1,	1655726537,	NULL,	0),
('SCHLR-ZLKRN-470e43',	'USR-ZLKRN-79886',	'Azalia Shanika Karin',	'2005-11-06',	'82216999368',	'Komplek Baros Indah no. 51 A RT 02 RW 03 Kelurahan Utama, Kecamatan Cimahi Selatan, Kota Cimahi, Jawa Barat 40533',	'MIPA',	'SMAN 5 Bandung',	'3.30',	'3',	'Halo, nama saya Azalia Shanika Karin, akrab disapa Karin. Umur saya 16 tahun, saat ini saya sedang menempuh pendidikan SMA kelas 2. Saya adalah anak bungsu dari tiga bersaudara yang dibesarkan dengan penuh kasih sayang. Saya bersekolah di SMA Negeri 5 Bandung, salah satu sekolah bergengsi di Kota Bandung. Berbicara tentang gengsi, saya termasuk orang yang kompetitif. Sejak kecil saya dibimbing oleh kedua orang tua untuk mengetahui apa minat dan bakat yang saya miliki, salah satunya menyanyi. Menginjak umur 7 tahun, saya berhasil mendapatkan Juara 1 PMC Indinesia 2013 Tingkat Wilayah untuk lanjut ke tahap berikutnya, tingkat nasional. Sampai tahun 2018, senang sekali akhirnya saya mendapatkan Juara 2 PMC Indinesia 2018 Tingkat Nasional yang diselenggarakan di Jakarta. Selain berkompetisi musik, saya juga senang berbicara di depan publik. Tahun 2019, saya mengikuti ajang kompetisi Erlangga English Speech Contest dan meraih Juara 2 Tingkat Provinsi. Selain rasa senang kepada diri sendiri atas prestasi yang saya capai, saya juga ingin membanggakan kedua orang tua dengan bakat dan prestasi yang saya miliki. Di jenjang SMA ini, semangat saya semakin bertambah. Saya ingin mengukir prestasi baru dalam berbagai bidang, baik kompetisi, aktivis, bahkan menjadi bagian dari program beasiswa. ',	'Mimpi terbesar saya saat ini adalah mendapat beasiswa untuk berkuliah di perguruan tinggi ternama di luar negeri, terutama di negara Amerika Serikat. Untuk mewujudkan cita-cita tersebut, saya harus membuat rencana yang matang dimulai dari sekarang. Langkah awal saya adalah mencoba program KL-YES, yang diselenggarakan oleh Bina Antar Budaya bagi pelajar SMA, ternyata tempat itu bukan untuk saya. Namun saya tidak menyerah, dengan keinginan saya yang kuat untuk kuliah di luar negeri, mulailah saya bereksplorasi. Pertama, saya mencari tahu perguruan tinggi Amerika mana saja yang membuka peluang beasiswa untuk pelajar internasional. Lalu, saya mencari tahu lebih lanjut apa saja syarat dan ketentuan agar saya masuk ke dalam kriteria beasiswa yang ditetapkan. Tak sampai disitu, saya juga mengikuti kegiatan-kegiatan seperti webinar, workshop, bahkan menjadi aktivis dalam berbagai program. Tak mudah memang keluar dari zona nyaman. Tetapi, mimpi ini ingin saya wujudkan karena menurut saya, dengan berkuliah ke luar negeri saya akan memiliki wawasan yang lebih luas karena pergaulan dan lingkungan pendidikan skala internasional. Selain itu, saya juga ingin membanggakan kedua orang tua dan memiliki masa depan cerah yang saya impikan.',	'Saya memiliki pengalaman menjadi Sekretaris OSIS di SMA, dimulai dari Masa Orientasi Siswa hingga saya bergabung menjadi Pengurus OSIS, banyak hal bermanfaat yang saya dapatkan. mendapat relasi baru, meningkatkan soft skill, lebih cepat tanggap, bahkan istilah-istilah terkait organisasi yang sebelumnya saya tidak tahu, dan masih banyak lagi. Kemudian saat SMP, saya menjadi Ketua Program Literasi di sekolah dan menjadi perwakilan untuk mengikuti Workshop Menulis dan Literasi Digital pada tahun 2019.',	1,	1655700268,	NULL,	0),
('SCHLR-ZLVYF-566963',	'USR-ZLVYF-c1324',	'ZULVY FAUZIAH',	'2001-11-11',	'85649257630',	'Gg. Semar Dusun Meli\'an RT 002/RW 010 Desa Kejapanan Kecamatan Gempol Kabupaten Pasuruan',	'Geografi Fakultas Ilmu Sosial',	'UNIVERSITAS NEGERI MALANG',	'3.68',	'4',	'Saya merupakan putri pertama dari dua bersaudara. Saya memiliki cukup kompetensi di bidang geografi dan teknologi. Saya merupakan orang yang disiplin dan selalu memanfaatkan waktu dengan baik. Selain itu, saya mampu bekerja di dalam tim, tersusun, terstruktur, dan cukup berpengetahuan dalam hal administrasi maupun keuangan',	'Mimpi terbesar saya untuk saat ini adalah melanjutkan kuliah S2 di bidang yang saya minati baik di kampus dalam negeri maupun luar negeri dengan beasiswa. Cara untuk mewujudkannya adalah mencari informasi tentang beasiswa yang relevan dan berusaha untuk apply dengan sebaik-baiknya. Selain itu tugas utama sebagai mahasiswa untuk belajar dan lebih peka dengan lingkungan sekitar juga harus dijalankan dengan sebaik-baiknya sesuai kemampuan ',	'Saya pernah menjabat sebagai anggota pengurus Divisi Pendidikan dan Penelitian Himpunan Mahasiswa Departemen Geografi Universitas Negeri Malang periode 2021/2022',	1,	1654663177,	NULL,	0),
('SCHLR-ZNBZZ-a858db',	'USR-ZNBZZ-09188',	'Zanuba Azizah Rahmawati',	'2003-12-12',	'85875442258',	'Jl. Kendalisada, RT 04/RW 03, Kel. Tritih Wetan, Kec. Jeruklegi, Kab. Cilacap, Jawa Tengah',	'Pendidikan Biologi',	'Universitas Tidar Magelang',	'0.00',	'0',	'Nama saya Zanuba Azizah Rahmawati, lahir pada 12 Desember 2003, dan saya tinggal di kota Cilacap, Jawa Tengah. Saya lulusan dari MAN 1 Cilacap jurusan IPA, dan kini saya menjadi CAMABA jalur SNMPTN tahun 2022 di Universitas Tidar Magelang program studi Pendidikan Biologi.\r\n\r\nSaya merupakan anak ke 2 dari 2 bersaudara. Ayah saya hanya seorang buruh dan ibu saya hanya seorang guru honorer. Dengan penghasilan kedua orang tua saya yang pas-pasan, saya berkeinginan untuk mendapatkan beasiswa sehingga bisa meringankan beban kedua orang tua saya. \r\n\r\nDalam hal akademik, saya selalu menempati peringkat 1 dan 2 di kelas selama bersekolah di MAN 1 Cilacap. Dengan prestasi saya tersebut, saya mendapatkan beasiswa di sekolah saya. Selain itu, saya juga pernah mengikuti perlombaan karya ilmiah tingkat Kabupaten tahun 2021 dan menjadi finalis 12 besar. Saya juga pernah mengikuti Perkemahan Ilmiah Remaja yang diselenggarakan oleh LIPI (Lembaga Ilmu Pengetahuan Indonesia) pada tahun 2019. Di bidang non akademik, saya juga pernah mengikuti beberapa perlombaan yang diadakan di Madrasah. Diantaranya saya memperoleh juara 1 lomba Arabic Speech dan juara 1 lomba MFQ (Musabaqoh Fahmil Quran) tingkat MAN 1 Cilacap.\r\n\r\nSaya ingin memperoleh beasiswa dengan harapan saya bisa meringankan beban orang tua saya dalam hal biaya kuliah. Saya juga ingin meningkatkan bakat dan minat saya dan ingin mendapatkan pengalaman baru sebagai bekal di masa depan melalui program beasiswa ini.\r\n\r\nSaya memilih jurusan Pendidikan Biologi karena pendidikan merupakan aspek yang sangat penting dalam kehidupan. Dengan pendidikan, kita mampu menciptakan sumber daya manusia yang berkualitas. Dan biologi juga merupakan bidang ilmu yang sangat penting karena hampir seluruh bidang ilmu di dunia memerlukan aspek ilmu biologi untuk memahami secara utuh.\r\n\r\nMasalah keuangan menjadi alasan utama saya untuk mendapatkan beasiswa. Dan saya memiliki minat dan bakat yang saya yakini mampu untuk kuliah dengan baik dan lulus menjadi sarjana yang memiliki keahlian dalam bidang pendidikan, Insyaallah. ',	'Mimpi terbesar saya adalah saya ingin menjadi manusia yang bermanfaat untuk banyak orang. Saya ingin memperbaiki wajah pendidikan di Indonesia menjadi lebih baik lagi dan berkualitas. \r\n\r\nDan saya juga memiliki mimpi besar untuk menjadi seorang pengusaha yang sukses. Karena saya ingin menciptakan sebuah lapangan pekerjaan, sehingga saya bisa membantu banyak orang.\r\n\r\nUntuk mewujudkan semua itu langkah pertama yang saya lakukan adalah berdoa kepada Allah Subhanahu wa Ta\'ala supaya dimudahkan untuk mencapai cita-cita saya. Kemudian saya berusaha untuk belajar lebih giat lagi dan mencari berbagai inspirasi yang bisa memicu semangat saya untuk menggapai cita-cita saya.',	'Saya memiliki pengalaman organisasi saat saya duduk di bangku SMP ataupun SMA. Saat di bangku SMP saya pernah menjabat sebagai ketua OSIS tahun 2018/2019. Saya juga aktif dalam kegiatan kepramukaan. Saat saya dibangku SMA saya mengikuti organisasi Karya Ilmiah Remaja.',	1,	1655215623,	NULL,	0),
('SCHLR-ZNBZZ-fced06',	'USR-ZNBZZ-09188',	'Zanuba Azizah Rahmawati',	'2003-06-14',	'85875442258',	'Jl. Kendalisada, RT 04/RW 03, Kel. Tritih Wetan, Kec. Jeruklegi, Kab. Cilacap, Jawa Tengah',	'Pendidikan Biologi',	'Universitas Tidar Magelang',	'0.00',	'0',	'Nama saya Zanuba Azizah Rahmawati, lahir pada 12 Desember 2003, dan saya tinggal di kota Cilacap, Jawa Tengah. Saya lulusan dari MAN 1 Cilacap jurusan IPA, dan kini saya menjadi CAMABA jalur SNMPTN tahun 2022 di Universitas Tidar Magelang program studi Pendidikan Biologi.\r\n\r\nSaya merupakan anak ke 2 dari 2 bersaudara. Ayah saya hanya seorang buruh dan ibu saya hanya seorang guru honorer. Dengan penghasilan kedua orang tua saya yang pas-pasan, saya berkeinginan untuk mendapatkan beasiswa sehingga bisa meringankan beban kedua orang tua saya. \r\n\r\nDalam hal akademik, saya selalu menempati peringkat 1 dan 2 di kelas selama bersekolah di MAN 1 Cilacap. Dengan prestasi saya tersebut, saya mendapatkan beasiswa di sekolah saya. Selain itu, saya juga pernah mengikuti perlombaan karya ilmiah tingkat Kabupaten tahun 2021 dan menjadi finalis 12 besar. Saya juga pernah mengikuti Perkemahan Ilmiah Remaja yang diselenggarakan oleh LIPI (Lembaga Ilmu Pengetahuan Indonesia) pada tahun 2019. Di bidang non akademik, saya juga pernah mengikuti beberapa perlombaan yang diadakan di Madrasah. Diantaranya saya memperoleh juara 1 lomba Arabic Speech dan juara 1 lomba MFQ (Musabaqoh Fahmil Quran) tingkat MAN 1 Cilacap.\r\n\r\nSaya ingin memperoleh beasiswa dengan harapan saya bisa meringankan beban orang tua saya dalam hal biaya kuliah. Saya juga ingin meningkatkan bakat dan minat saya dan ingin mendapatkan pengalaman baru sebagai bekal di masa depan melalui program beasiswa ini.\r\n\r\nSaya memilih jurusan Pendidikan Biologi karena pendidikan merupakan aspek yang sangat penting dalam kehidupan. Dengan pendidikan, kita mampu menciptakan sumber daya manusia yang berkualitas. Dan biologi juga merupakan bidang ilmu yang sangat penting karena hampir seluruh bidang ilmu di dunia memerlukan aspek ilmu biologi untuk memahami secara utuh.\r\n\r\nMasalah keuangan menjadi alasan utama saya untuk mendapatkan beasiswa. Dan saya memiliki minat dan bakat yang saya yakini mampu untuk kuliah dengan baik dan lulus menjadi sarjana yang memiliki keahlian dalam bidang pendidikan, Insyaallah. ',	'Mimpi terbesar saya adalah saya ingin menjadi manusia yang bermanfaat untuk banyak orang. Saya ingin memperbaiki wajah pendidikan di Indonesia menjadi lebih baik lagi dan berkualitas. \r\n\r\nDan saya juga memiliki mimpi besar untuk menjadi seorang pengusaha yang sukses. Karena saya ingin menciptakan sebuah lapangan pekerjaan, sehingga saya bisa membantu banyak orang.\r\n\r\nUntuk mewujudkan semua itu langkah pertama yang saya lakukan adalah berdoa kepada Allah Subhanahu wa Ta\'ala supaya dimudahkan untuk mencapai cita-cita saya. Kemudian saya berusaha untuk belajar lebih giat lagi dan mencari berbagai inspirasi yang bisa memicu semangat saya untuk menggapai cita-cita saya.',	'Saya memiliki pengalaman organisasi saat saya duduk di bangku SMP ataupun SMA. Saat di bangku SMP saya pernah menjabat sebagai ketua OSIS tahun 2018/2019. Saya juga aktif dalam kegiatan kepramukaan. Saat saya dibangku SMA saya mengikuti organisasi Karya Ilmiah Remaja.',	1,	1655216145,	NULL,	0),
('SCHLR-ZTXNX-f4ff4c',	'USR-ZTXNX-019a0',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'',	NULL,	NULL,	NULL,	NULL,	1,	1655743687,	NULL,	0),
('SCHLR-ZZ-6c87e9',	'USR-ZZ-308f56',	'Aziza',	'2003-12-12',	'83841809727',	'Anakan kenagarian koto nan duo IV koto hilie kecamatan batang kapas kabupaten pesisir selatan provinsi Sumatera Barat',	'Akuntansi syariah/Fakultas eko',	'Institut Agama Islam Negeri Ba',	'0.00',	'1',	'Saya baru akan masuk kuliah nanti di IAIN Batusangkar dengan jurusan akuntansi syariah, saya ingin memperoleh tunjangan beasiswa untuk melanjutkan pendidikan saya dan saya ingin menjadi orang yang ber pemikiran maju dengan berpedoman kepada Allah SWT',	'Mimpi terbesar saya itu ingin menjadi orang sukses dan kaya yang berkah, dengan itu saya bisa membanggakan dan membahagiakan orang tua saya. Cara saya mewujudkan nya yaitu dengan terus belajar dan berjuang untuk pendidikan saya sendiri tanpa menyusahkan kedua orang tua oleh karena itu saya ingin daftar beasiswa ini',	'Ya saya pernah jadi anggota OSIS dibidang kesenian saat SMA. Disana saya bisa belajar cara bicara didepan orang banyak dengan percaya diri serta melatih kekompakan dalam kelompok',	1,	1654674614,	NULL,	0),
('SCHLR-ZZTHL-08f08d',	'USR-ZZTHL-9cb80',	'Izzathul Maghfira',	'2003-09-17',	'85296104243',	'Jl. Bunga Rinte, Komplek Puri Zahara 2 Blok P nomor 57, Simpang Selayang, Medan Tuntungan, Medan, Sumatera Utara.',	'Ilmu Hukum/Hukum',	'Universitas Sumatera Utara',	'3.30',	'2',	'Menurut saya, saya adalah sosok yang pantang menyerah. Bukan membanggakan diri, tetapi memang pada dasarnya saya memiliki tujuan untuk sampai pada tujuannya setiap kali sudah menetapkan sesuatu. Saya juga sangat suka berkecimpung di masyarakat dan organisasi sosial karena saya suka untuk mencari, mengetahui, mempelajari hal baru dan bertemu orang baru pula. Saya tipe orang yang tidak membiarkan diri saya berlarut larut dalam satu kegagalan, menurut saya kegagalan itu bukan untuk diratapi yetapi untuk menjadi pelajaran. Sedib adalah hal yang wajar, tapi kita tidak boleh berlarut di dalamnya. Saya pun merupak orang yang berprinsip untuk selalu maju ke depan dan terus berkembang.',	'Bagi orang lain mungkin ini bukan mimpi besar tetapi bagi saya, membahagiakan orang tua saya adalah mimpi terbesar saya. Saya ingin melihat orang tua saya bangga akan prestasi dan pencapaian saya dalam hal apa pun. Dan mengenai bagaimana saya mewujudkannya pastinya dengan tidak berhenti berusaha dan terus mencari prestasi. Tidak boleh ada kata puas dengan kondisi sekarang, harus terus berkembang menjadi pribadi yang lebih baik. Karena itu saya masih terus melanjutkan studi saya untuk menjadi representasi Indonesia di dalam masyarakat internasional yaitu menjadi Duta Besar Indonesia suatu hari nanti.',	'Seperti yang saya singgung sebelumnya, saya sangat menyukai berada di dalam organisasi. Sewaktu SMA saya menjadi bagian dari OSIS dan menjafi Wakil Ketua Divisi Bakat dan Prestasi, saya juga berkecimpung di dalam pramuka dan paskibra untuk kabupaten. Untuk organisasi di luar sekolah, saya merupakan bagian dari Zona Masuk PTN. Lalu sewaktu kuliah, saya menjalani volunteer di organisasi hukum yaitu Taman Hukum dan mengikuti Unit Kegiatan Mahasiswa di kampus, yaitu Meriam Debating Club.',	1,	1654589832,	NULL,	0),
('SCHLR-ZZTNN-ad4e1d',	'USR-ZZTNN-50107',	'Izzatun Nuha Siddik',	'2002-01-06',	'81584461115',	'Puri Zahara 2 Blok Q7, Jl. Bunga Rinta, Kel. Simpang Selayang, Kec. Medan Tuntungan, Kota Medan',	'Psikologi/Fakultas Ilmu Pendid',	'Universitas Pendidikan Indones',	'3.63',	'4',	'Izzatun Nuha Siddik adalah seorang remaja berusia 20 tahun.  Ia menyukai bidang kemanusiaan, kesehatan mental, pengembangan diri, literasi, dan seni. Walaupun Nuha merupakan orang yang cenderung kurang dapat bersosialisasi dan berkomunikasi dengan baik, ia cukup pandai dalam manajemen tim, sangat bertanggung jawab, pembelajar yang cepat, dan dapat dipercaya. Menjadi lebih baik dari sebelumnya adalah salah moto hidupnya.',	'Saya ingin menjadi seorang psikolog dan akademisi yang terjun di bidang kemanusiaan. Maka dari itu, saya memutuskan untuk masuk jurusan psikologi agar lebih dapat mengenal manusia dengan baik, kemudian mengikuti organisasi dan kegiatan kerelawanan di kampus. Untuk pencapai level sebagai tertinggi dari mimpi saya, saya pun bercita-cita untuk melanjutkan S2 di luar negeri untuk menimba ilmu dan pengalaman seputar Psikologi di sana.',	'Di kampus, saya mengikuti 2 organisasi utama sebagai anggota yaitu LDK UKDM UPI, atau kerohanian kampus, dan KSR PMI Unit UPI, atau kerelawanan kampus. Dan juga dalam 2 tahun kuliah, saya mengikuti lebih dari 10 kepanitiaan beberapa acara internal kampus. Kebanyakan menjadi anggota yang bertanggung jawab dalam per-desain-an karena saya menyukai seni.',	1,	1655648487,	NULL,	0),
('SCHLR-ZZTZZ-5bad90',	'USR-ZZTZZ-d3e2d',	'Azizatuz Zahro',	'2003-07-02',	'882007296050',	'Payaman RT 1 RW 2 Mejobo, Kudus',	'S1 Matematika',	'Universitas Muhammadiyah Kudus',	'3.83',	'2',	'Saya Azizatuz Zahro. Saya dibesarkan oleh single parent, yaitu ibu saya yang bernama Sri Alfiyah. Saya memiliki seorang adik. Saya kuliah di Universitas Muhammadiyah Kudus Program studi Matematika Murni dan menjadi staff muda Badan Eksekutif Mahasiswa di kampus saya. ',	'Saya ingin mengelola sekolah alam, dengan tujuan agar anak anak dapat belajar dengan have fun tanpa beban. Saya belajar hal hal kecil tentang peduli lingkungan dan isu sosial melalui Kementerian Sosial Masyarakat dalam organisasi BEM di kampus. Dengan harapan, ilmu yang saya dapat, akan saya aplikasikan saat saya memiliki sekolah alam dan saya memiliki banyak kerja sama dari berbagai pihak. ',	'Saya menjadi Koordinator bidang Bina Usaha dalam organisasi kepramukaan saat saya masih SMA. Saat kuliah ini, saya memiliki pengalaman baru menjadi bagian dari staff muda, berbagi takjil, berkunjung ke Dinas Sosial, menggalang donasi, dan turut serta membuat event nasional. ',	1,	1653793091,	NULL,	0);
